(76, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'CRUSTACEA', 'GIÁP XÁC', 'CLA_05', 'DECAPODA', 'GIÁP XÁC MƯỜI CHÂN', 'ORD_030', 'Palaemonidae', 'Tôm Gai', 'FAM_269', 'Macrobrachium', NULL, 'GEN_1134', 'macrobrachiumsp', 'Macrobrachium sp', NULL, NULL, 'SPA_00076', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(77, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'CRUSTACEA', 'GIÁP XÁC', 'CLA_05', 'DECAPODA', 'GIÁP XÁC MƯỜI CHÂN', 'ORD_030', 'Palaemonidae', 'Tôm Gai', 'FAM_269', 'Macrobrachium', NULL, 'GEN_1134', 'macrobrachiumyeti', 'Macrobrachium yeti', 'Dang, 1975', NULL, 'SPA_00077', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(78, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'CRUSTACEA', 'GIÁP XÁC', 'CLA_05', 'DECAPODA', 'GIÁP XÁC MƯỜI CHÂN', 'ORD_030', 'Potamidae', 'Cua Núi', 'FAM_301', 'Orientalia', NULL, 'GEN_1396', 'orientaliasp', 'Orientalia sp', NULL, NULL, 'SPA_00078', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(79, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'CRUSTACEA', 'GIÁP XÁC', 'CLA_05', 'DECAPODA', 'GIÁP XÁC MƯỜI CHÂN', 'ORD_030', 'Potamidae', 'Cua Núi', 'FAM_301', 'Potamiscus', NULL, 'GEN_1618', 'potamiscuscucphuongensis', 'Potamiscus cucphuongensis', 'Dang, 1975.', 'Cua núi cúc phương ', 'SPA_00079', 'Vỏ đầu ngực có dạng gần vuông, vùng giữa nhẵn, có hình vẽ dạng hoa thị, trán hẹp chia hai thuỳ rõ rệt. Vùng góc trước và vùng trán xù xì. Chân bò dài, đốt cùng phần bụng có dạng tam giác tròn đầu, cạnh bên hơi cong. Sống ở suối vùng rừng núi, khe suối hẹp thuộc khu vực hạng động đá vôi.', NULL, 'Ninh Bình (suối Cúc Phương). ', NULL, 'Diện tích nơi phân bố rất hẹp, chỉ ở trong Vườn quốc gia Cúc Phương. Diện tích nơi cư trú rất hẹp, ước tính dưới 100km2.', 'Loài đặc hữu, có giá trị khoa học.', 'LR', NULL, NULL, 'vncreatures.net'),
(80, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'CRUSTACEA', 'GIÁP XÁC', 'CLA_05', 'DECAPODA', 'GIÁP XÁC MƯỜI CHÂN', 'ORD_030', 'Potamidae', 'Cua Núi', 'FAM_301', 'Potamiscus', NULL, 'GEN_1618', 'potamiscustannanti', 'Potamiscus tannanti', '(Rathbun, 1904)', 'Cua núi mai giáp ', 'SPA_00080', 'Giáp đầu ngực thẳng, vùng giữa nhẵn, cạnh trước trán nhăn nheo, chia 4 thùy không rõ rệt, vùng góc trước và trán có mấu lồi xù xì, các rãnh gờ và thuỳ nổi rõ. Gai ổ mắt lớn, gai trên mang nhỏ, chân bò tầy, ngắn. Đốt cùng phần bụng hình tam giác đều, đầu tròn, cạnh bên gần như thẳng. Sống ở sông suối vùng núi và trung du giáp núi.', NULL, ' Lào Cai, Hoà Bình. Trung Quốc (Vân Nam: Hà Khẩu).', NULL, 'Diện tích phân bố hẹp, ước tính dưới 20,000km2. Đang bị khai thác nhiều nên diện tích nơi cư trú giảm, ước tính 2,000km2.', NULL, 'VU', NULL, NULL, 'vncreatures.net'),
(81, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'CRUSTACEA', 'GIÁP XÁC', 'CLA_05', 'DECAPODA', 'GIÁP XÁC MƯỜI CHÂN', 'ORD_030', 'Potamidae', 'Cua Núi', 'FAM_301', 'Ranguna', NULL, 'GEN_1712', 'rangunacochinchinensis', 'Ranguna cochinchinensis', '(De Haan, 1898). ', NULL, 'SPA_00081', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(82, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'CRUSTACEA', 'GIÁP XÁC', 'CLA_05', 'DECAPODA', 'GIÁP XÁC MƯỜI CHÂN', 'ORD_030', 'Potamidae', 'Cua Núi', 'FAM_301', 'Ranguna', NULL, 'GEN_1712', 'rangunakimboiensis', 'Ranguna kimboiensis', 'Dang, 1980.', 'Cua núi kim bôi ', 'SPA_00082', 'Vỏ đầu ngực rộng ngang. Vùng giữa mặt vỏ nhẵn, chỉ có chấm, chỉ trừ vùng góc trước và vùng trán có mấu xù xì. Trán hẹp ngang nhưng rộng bản, cạnh trước lõm ở khoảng giữa, góc bên tròn. Chân bò mảnh dài. Đốt cùng phần bụng con đực có dạng tam giác đều, đầu vuốt tròn. Sống ở suối, sông vùng núi và trung du giáp núi.', NULL, 'Hoà Bình (Chi Nê, Kim bôi), Ninh Bình (Cúc Phương). ', NULL, 'Là loài đặc hữu, phân bố chỉ ở một dải hẹp vùng núi đá vôi Kim Bôi - Cúc Phương, diện tích phân bố ước tính dưới 20,000km2. Diện tích nơi cư trú rất hẹp, ước tính dưới 100km2.', 'Có giá trị thực phẩm.', 'VU', NULL, NULL, 'vncreatures.net'),
(83, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'CRUSTACEA', 'GIÁP XÁC', 'CLA_05', 'DECAPODA', 'GIÁP XÁC MƯỜI CHÂN', 'ORD_030', 'Potamidae', 'Cua Núi', 'FAM_301', 'Sosanniathelphusa', NULL, 'GEN_1834', 'sosanniathelphusadugasti', 'Sosanniathelphusa dugasti', '(Rathbun, 1902)', NULL, 'SPA_00083', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(84, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'CRUSTACEA', 'GIÁP XÁC', 'CLA_05', 'DECAPODA', 'GIÁP XÁC MƯỜI CHÂN', 'ORD_030', 'Potamidae', 'Cua Núi', 'FAM_301', 'Sosanniathelphusa', NULL, 'GEN_1834', 'sosanniathelphusasinensis', 'Sosanniathelphusa sinensis', 'Alcock, 1910', 'Cua đồng ', 'SPA_00084', 'Cua đồng phân bố rộng ở vùng nước ngọt, từ đồng bằng, trung du, miền núi. Là động vật sống ở tầng đáy, ưa nước sạch, đào hang thích nghi với bùn sét, bùn cát. Chúng sinh sản quanh năm nếu môi trường thuận lợi, tập trung vào mùa xuân, mùa hè, mùa thu. Độ pH thích hợp từ 5,6 - 8, nhiệt độ từ 10 - 31oC, tốt nhất là 15 - 25oC, lượng oxy hòa tan thấp nhất là 2 mg/l. Cua đồng sống trong các hang, lỗ tại các bờ ruộng, bờ kênh, rạch, chúng thường bò ra khỏi hang kiếm ăn, xong lại trốn vào hang. Lưng cua đồng có màu vàng sẫm, đều có hai càng, một to và một càng nhỏ hơn, hai gọng cua đồng có màu vàng cháy, toàn thân có màu sắc nâu vàng. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'vi.wikipedia.org'),
