(173, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Carabidae', 'Chân Chạy', 'FAM_064', 'Pheropsophus', NULL, 'GEN_1531', 'pheropsophusjavanus', 'Pheropsophus javanus', '(Dejean, 1825)', NULL, 'SPA_00173', 'Chiều dài: 18,0 – 19,0 mm; TW: 6,8 – 7,3 mm Màu sắc: Đầu màu vàng đỏ; đốm đen lớn xuất hiện trên đỉnh đầu; palpi màu vàng đỏ; râu màu vàng đỏ nhạt, nâu nhạt từ đốt thứ 4 trở đi; mắt màu xám; pronotum màu đen có hai đốm hình bầu dục màu vàng đỏ nhạt ở hai bên rãnh giữa; elytra đen; chân có nửa trước màu vàng đỏ và nửa sau màu nâu đỏ; xương đùi và xương chày màu vàng đỏ có đốm đen ở đỉnh xương đùi; tarsi màu nâu đỏ với móng vuốt màu nâu sẫm. Mặt dưới đầu màu vàng đỏ; phần trước màu nâu đỏ có đốm vàng đỏ ở đầu; mạc treo và xương ức có viền bên màu vàng đỏ và nâu ở giữa; mesepisternum có màu vàng đỏ trong khi proepisternum và metepisternum có màu nâu đen; xương ức có màu nâu đỏ phía trước và màu nâu đen phía sau. Đầu: Rộng; mắt lồi ra; có một điểm nổi bật (có hình dạng khác nhau) trên đỉnh; labrum lồi, dài và nhô ra.  ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'gbif.org'),
