(187, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Cerambycidae', 'Xén Tóc', 'FAM_066', 'Anoplophora', NULL, 'GEN_0108', 'anoplophoraalbopicta', 'Anoplophora albopicta', '(Matsushita, 1933)', 'Xén tóc xanh đốm trắng', 'SPA_00187', 'Loài xén tóc có kích thước khá lớn, cơ thể có màu đen bóng, ánh xanh hoặc hơi ánh tím khi quan sát ở ngoài tự nhiên. Đầu cụp, phần đầu và phần ngực trước có vệt màu đen ánh xanh tím. Mép bên ngực trước có một gai lớn, thẳng. Cánh cứng được điểm xuyết bằng những đóm màu trắng không đều và không đồng nhất. Râu đầu dài hơn cơ thể, có các vòng phấn màu ánh xanh ở phần gốc và phần ngọn của tất cả các đốt. Chân màu đen bóng, các đốt bám có màu xanh ở tất cả các đốt. Kích thước cơ thể từ 28 - 38mm Cá thể trưởng thành thường xuất hiện từ tháng tư đến tháng sáu hằng năm ở phía khắp các tỉnh từ Bắc đến Nam và ở độ cao từ 900m trở lên, ven các khu rừng thường xanh núi cao còn tốt. Ấu trùng của loài này chưa được nghiên cứu sâu', NULL, 'Phân bố khắp Việt Nam Trên thế giới là loài phổ biến ở Ấn Độ, Thái Lan, Lào, Cambodia và Myanma', NULL, NULL, 'Là loài được dùng làm sinh vật chỉ thị cho rừng nguyên sinh còn tốt ở đó có nhiều cây gỗ lớn', NULL, NULL, NULL, 'VN Creature'),
