(193, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Cerambycidae', 'Xén Tóc', 'FAM_066', 'Aristobia', NULL, 'GEN_0161', 'aristobiatestudo', 'Aristobia testudo', '(Fabricius, 1781)', NULL, 'SPA_00193', 'Sâu trưởng thành là loài bướm rất nhỏ, thân dài khoảng 3mm, sải cánh rộng 8-9mm. Cánh và toàn thân màu nâu, trên cặp cánh trước có một đốm màu vàng sáng ở chóp cánh. Rìa cánh trước và cánh sau có hàng lông dài, mịn, màu đen. Cánh sau rất hẹp. Chân dài và mảnh. Râu đầu dài và hướng về phía trước khi bướm đậu. Sâu non rất nhỏ, màu xanh nhạt, đốt bụng dài và có nhiều lông ngắn, đẫy sức dài 5mm. Nhộng rất nhỏ, lúc đầu màu xanh nhạt, khi sắp vũ hoá có màu vàng nâu.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Aristobia_testudo'),
