(244, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Cerambycidae', 'Xén Tóc', 'FAM_066', 'Chlorophorus', NULL, 'GEN_0390', 'chlorophorusannularis', 'Chlorophorus annularis', '(Fabricius, 1787)', NULL, 'SPA_00244', 'Đầu và thân Chlorophorus annularis có màu vàng nổi bật với các vết đen như hổ. Bọ cánh cứng trưởng thành có kích thước nhỏ, dài khoảng 0,6 inch (15 mm) x rộng 0,2 inch (5 mm) và chúng có râu rất dài. Chúng dựa vào tre để hoàn thành vòng đời nên những con trưởng thành thường được tìm thấy gần tre. Nhộng có màu sắc tương tự ấu trùng, có râu và chân ôm sát cơ thể. Những con trưởng thành mới trốn thoát qua các lỗ có đường kính khoảng 0,08-0,12 inch (2-3 mm). ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'wiki.bugwood.org'),
