(246, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Cerambycidae', 'Xén Tóc', 'FAM_066', 'Distenia', NULL, 'GEN_0594', 'disteniasp1', 'Distenia sp1', NULL, NULL, 'SPA_00246', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(247, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Cerambycidae', 'Xén Tóc', 'FAM_066', 'Dorysthenes', NULL, 'GEN_0606', 'dorysthenesbuqueti', 'Dorysthenes buqueti', '(Guérin - Méneville, 1844)', NULL, 'SPA_00247', 'Loài xén tóc có kích thước trung bình, chiều dài cơ thể khoảng 38 - 41 mm (1,5 - 1,6 in) và chiều rộng cơ thể trong khoảng 14 - 16 mm (0,55 - 0,63 in). Màu sắc chủ đạo là màu nâu, nâu đỏ hoặc nâu sáng bóng, phần đầu, răng, gốc anten có màu đen đậm\\. Anten khá dài và chia từ 10  - 12 đốt, các đốt gốc phình to rõ rệt. Thân ngắn, mỗi bên thân có 3 gai nhọn, 2 gai gần đầu bằng nhau và gai gần bụng nhỏ hơn.', NULL, 'Loài khá phổ biến và phát hiện ở hầu hết các tỉnh phía Nam Việt Nam. Trên thế giới là loài phổ biến ở Ấn Độ, Thái Lan, Lào, Cambodia và Mianma.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=3&ID=417'),
