(316, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Chrysomelidae', 'Cánh Cứng Ăn Lá', 'FAM_082', 'Aulacophora', NULL, 'GEN_0187', 'aulacophoracruenta', 'Aulacophora cruenta', '(Fabricius, 1781)', '', 'SPA_00316', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(317, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Chrysomelidae', 'Cánh Cứng Ăn Lá', 'FAM_082', 'Aulacophora', NULL, 'GEN_0187', 'aulacophorafemoralis', 'Aulacophora femoralis', '(Motschulsky, 1857)', NULL, 'SPA_00317', 'Thân dài và hình bầu dục, phần phía sau hơi phình ra. Chiều dài cơ thể 6 đến 8 mm. Con trưởng thành dài 7-8 mm. Tổng thể màu vàng cam hoặc đỏ cam, đôi khi hơi nâu. Nó ăn rễ mịn hoặc đục sâu vào rễ và thân gần mặt đất, làm cho cây bị úa lá và trụi lá. Môi trên màu đen hạt dẻ. Mắt tổng hợp, màng não và bề mặt bụng của bụng đều có màu đen ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(318, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Chrysomelidae', 'Cánh Cứng Ăn Lá', 'FAM_082', 'Aulacophora', NULL, 'GEN_0187', 'aulacophoraforcicollis', 'Aulacophora forcicollis', 'Lucas, 1849', '', 'SPA_00318', 'có chiều dài từ 5 đến 8 mm (0,2 đến 0,3 in) và chiều rộng khoảng 3,5 mm (0,14 in). Màu sắc của elytra thay đổi từ vàng cam nhạt đến đỏ cam sáng đến nâu vừa, bụng màu đen với những sợi lông trắng mềm. Ấu trùng được tìm thấy trong đất, mảnh mai và có màu vàng kem, đầu và phần trước ngực màu nâu nhạt.  Bọ cánh cứng phá hoại mạnh nhất vào tháng 3 và tháng 4 khi cây còn nhỏ. Chúng ăn lá, nụ, hoa và có thể làm rụng lá cây; sâu đục vào rễ và làm hư hại thân, quả nằm trên đất.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'en.wikipedia.org'),
