(354, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Chrysomelidae', 'Cánh Cứng Ăn Lá', 'FAM_082', 'Cryptocephalus', NULL, 'GEN_0493', 'cryptocephalusbirmanicus', 'Cryptocophalus birmanicus', 'Jac.', '', 'SPA_00354', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(355, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Chrysomelidae', 'Cánh Cứng Ăn Lá', 'FAM_082', 'Cryptocephalus', NULL, 'GEN_0493', 'cryptocephalustrifasciatus', 'Cryptocephalus trifasciatus', 'Jacoby, 1880', NULL, 'SPA_00355', 'Cryptocephalus trimaculatus có thể đạt chiều dài cơ thể 5,5–8 mm. Thân hình bầu dục và sáng bóng. Màu của đầu và đại từ là màu đen, trong khi elytra có màu đỏ cam, có ba đốm đen trên mỗi elytron. Có một đốm đen ở phía trước và hai đốm đen ở phía sau. Chúng có thể được kết nối với nhau trong một số chủ đề. Bụng và chân có màu đen. Hơn nữa, elytra được bao phủ theo chiều dọc bởi các hàng chấm đen nhỏ.  Con trưởng thành có thể được tìm thấy từ tháng 3 đến tháng 5 và từ tháng 7 đến tháng 9', NULL, ' Trung và Nam Âu và ở Cận Đông', NULL, NULL, NULL, NULL, NULL, NULL, 'en.wikipedia.org'),
(356, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Chrysomelidae', 'Cánh Cứng Ăn Lá', 'FAM_082', 'Dercetina', NULL, 'GEN_0565', 'dercetinasp1', 'Dercetina sp1', NULL, NULL, 'SPA_00356', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(357, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Chrysomelidae', 'Cánh Cứng Ăn Lá', 'FAM_082', 'Eumelepta', NULL, 'GEN_0686', 'eumeleptabiplagiata', 'Eumelepta biplagiata', 'Jacoby, 1892', '', 'SPA_00357', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(358, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Chrysomelidae', 'Cánh Cứng Ăn Lá', 'FAM_082', 'Hispa', NULL, 'GEN_0889', 'hispaarmigera', 'Hispa armigera', '(Olivier, 1808)', NULL, 'SPA_00358', 'Bọ trưởng thành là một loại bọ cánh cứng nhỏ màu đen, dài 5–6 mm, trên cánh có nhiều gai nhỏ. Trứng đẻ từng quả, hình bầu dục, màu trắng gần đỉnh lá non, được gắn chặt vào lá bằng chất dính do con cái tiết ra. Ấu trùng cơ thể dẹt, màu trắng. Nhộng dẹt, màu nâu. Cả hai nằm trong đường đục giữa 2 lớp biểu bì lá. Vòng đời chúng là từ 25-30 ngày. Bọ trưởng thành đẻ trứng 3-5 ngày và có thể sống hàng tháng. Bọ trưởng thành hoạt động ban ngày, ban đêm ẩn nấp, không vào đèn. Một con cái đẻ trung bình 50 trứng.', NULL, 'Bọ gai được ghi nhận xuất hiện ở các quốc gia như Ấn Độ, Bangladesh, Bhutan, Miến Điện, Indonesia, Campuchia, Lào, Malaysia, Miến Điện, Nepal, Pakistan, Thái Lan và Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/B%E1%BB%8D_gai'),
(359, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Chrysomelidae', 'Cánh Cứng Ăn Lá', 'FAM_082', 'Hoplasoma', NULL, 'GEN_0901', 'hoplasomaunicolor', 'Hoplasoma unicolor', 'Illiger, 1800', NULL, 'SPA_00359', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
