(395, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Cicindelidae', 'Hổ Trùng', 'FAM_086', 'Cicindela', NULL, 'GEN_0409', 'cicindelaaurulenta', 'Cicindela aurulenta', 'Fabricius, 1801', NULL, 'SPA_00395', 'Cicindela aurulenta đạt chiều dài khoảng 15–18 mm, có màu sắc đa sắc và óng ánhhình dáng bên ngoài. Loài này có elytra màu xanh lam, với sáu đốm lớn màu trắng vàng hoặc hơi xanh và hai đốm nhỏ hơn trên vai. Đốm lớn ở giữa có hình lưỡi liềm hơn so với các đốm trước và sau. Elytra của nó có màu đỏ cam dọc theo gốc và rìa. Khi nhìn từ mặt lưng, đầu và ngực có màu xanh lam, với màu đỏ cam trong một số điều kiện ánh sáng nhất định do màu sắc óng ánh của nó. Nó có hai mắt kép nổi bật và hàm dưới lớn, chủ yếu là màu đen với các mảng màu trắng vàng ở gốc. Nó có môi màu trắng ngà với phần đế và viền màu đen. Râu của nó có dạng sợi. Hình dạng, cuống và hai lá cờ đầu tiên của nó có màu xanh lam; trong khi các roi còn lại có màu đen xỉn. Nó có lông màu nhạt ở bụng và chân. ', NULL, ' Nepal, Bhutan, Ấn Độ, Trung Quốc và Đông Nam Á', NULL, NULL, NULL, NULL, NULL, NULL, 'en.wikipedia.org'),
