(416, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Coccinellidae', 'Bọ Rùa', 'FAM_095', 'Coccinellid', NULL, 'GEN_0440', 'coccinellidtransversalis', 'Coccinellid transversalis', 'Fabricius, 1781', NULL, 'SPA_00416', 'Sự chênh lệch về kích thước của những cá thể trong loài này là không lớn với chiều dài từ 3,8 đến 6,7 mm (0,15 đến 0,26 inch) và rộng từ 3,3 đến 5,45 mm (0,130 đến 0,215 inch). Nó có một cái đầu màu đen với cánh chủ yếu là màu đỏ tươi hoặc màu cam được đánh dấu đậm bằng một dải màu đen dọc theo đường giữa và hai dấu ba thùy bên.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/B%E1%BB%8D_r%C3%B9a_ch%E1%BB%AF_nh%C3%A2n'),
