(423, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Coccinellidae', 'Bọ Rùa', 'FAM_095', 'Epilachna', NULL, 'GEN_0661', 'epilachnavigintioctopunctata', 'Epilachna vigintioctopunctata', 'Farb.', NULL, 'SPA_00423', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(424, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Coccinellidae', 'Bọ Rùa', 'FAM_095', 'Harmonia', NULL, 'GEN_0820', 'harmoniadimidiata', 'Harmonia dimidiata', '(Fabr.)', '', 'SPA_00424', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(425, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Coccinellidae', 'Bọ Rùa', 'FAM_095', 'Harmonia', NULL, 'GEN_0820', 'harmoniaoctomaculata', 'Harmonia octomaculata', '(Fabricius, 1781)', NULL, 'SPA_00425', 'Đây là loài bọ rùa quý hiếm có chiều dài khoảng 8 mm. Elytra có màu vàng cam đậm với các chấm đen. Rệp cái trưởng thành đẻ trứng đơn lẻ hoặc thành cụm từ 21 đến 52 trứng trên cả hai mặt lá, đôi khi trên xác rệp chết. Trứng có màu vàng nhạt, hình bầu dục. Với sự phát triển, trứng chuyển sang màu đen và sau đó trở thành màu đen hoàn toàn trước khi nở. Chiều dài của trứng khoảng 1,25 đến 1,37 mm. Thời gian ủ bệnh thay đổi từ 3 đến 4 ngày. Sau khi tách trứng ở phần đỉnh, ấu trùng bắt đầu bò ra ngoài. Ấu trùng sơ sinh vẫn ở trên vỏ trứng một thời gian rồi di chuyển về phía con mồi để kiếm ăn. Ấu trùng tuổi thứ nhất có màu xám đen và được bao phủ bởi các cấu trúc gai khắp cơ thể. Đầu có viên nang tối màu sáng bóng. Chân cũng có màu sẫm hơn, tương đối dài hơn và có các khớp nối với cơ thể hình bầu dục. Chiều dài cơ thể tuổi 1 khoảng 1,75 – 2,08 mm. ', NULL, ' Ấn Độ, Pakistan, Nepal, Bangladesh, Sri Lanka, Micronesia và Úc. ', NULL, NULL, NULL, NULL, NULL, NULL, 'en.wikipedia.org'),
