(437, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Coccinellidae', 'Bọ Rùa', 'FAM_095', 'Henosepilachna', NULL, 'GEN_0862', 'henosepilachnasp8', 'Henosepilachna sp8', NULL, NULL, 'SPA_00437', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(438, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Coccinellidae', 'Bọ Rùa', 'FAM_095', 'Lemnia', NULL, 'GEN_1047', 'lemniabiplagiata', 'Lemnia biplagiata', 'Swartz, 1808', NULL, 'SPA_00438', 'Chiều dài cơ thể 4,8 ~ 6,8mm. Elytra có màu đỏ cam và các mảng màu đen khác nhau rất nhiều; các mảng màu đen tiêu chuẩn có hình mỏ neo, với một điểm đen ở bên trái và bên phải phía trước elytra; các mảng màu đen của các loại khác có mức độ mở rộng khác nhau và sáp nhập. Một số cá thể tương tự như bọ rùa sao đỏ, nhưng các đốm trắng ở cả hai mặt của pronotum có góc. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
