(440, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Coccinellidae', 'Bọ Rùa', 'FAM_095', 'Lemnia', NULL, 'GEN_1047', 'lemniasp2', 'Lemnia sp2', NULL, NULL, 'SPA_00441', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(441, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Coccinellidae', 'Bọ Rùa', 'FAM_095', 'Menochilus', NULL, 'GEN_1207', 'menochilussexmaculata', 'Menochilus sexmaculata', '(Fabr.)', '', 'SPA_00442', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(442, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Coccinellidae', 'Bọ Rùa', 'FAM_095', 'Micraspis', NULL, 'GEN_1216', 'micraspisdiscolor', 'Micraspis discolor', 'Fabricius, 1798', NULL, 'SPA_00443', 'Chiều dài cơ thể là 5 đến 6 mm. Con trưởng thành có thân hình bầu dục màu đỏ cam. Có sọc đen trên elytra Đây là một trong những loài bọ rùa phổ biến nhất được tìm thấy trong hệ sinh thái lúa, đặc biệt là trong quá trình ra hoa và ăn phấn hoa. Loài này có thể được sử dụng làm tác nhân kiểm soát sinh học đối với rầy nâu . Nó được tìm thấy ở cả hai loài bọ cánh cứng ăn côn trùng và thực vật.', NULL, ' Bangladesh, Trung Quốc, Ấn Độ, Malaysia, Sri Lanka, Đài Loan, Hoa Kỳ, Hawaii và Tonga.', NULL, NULL, NULL, NULL, NULL, NULL, 'en.wikipedia.org'),
(443, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Coccinellidae', 'Bọ Rùa', 'FAM_095', 'Micraspis', NULL, 'GEN_1216', 'micraspissatoi', 'Micraspis satoi', 'Miyatake, 1977', NULL, 'SPA_00444', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(444, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Coccinellidae', 'Bọ Rùa', 'FAM_095', 'Proplea', NULL, 'GEN_1633', 'propleasp1', 'Proplea sp1', NULL, NULL, 'SPA_00445', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(445, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Coccinellidae', 'Bọ Rùa', 'FAM_095', 'Rodolia', NULL, 'GEN_1757', 'rodoliaconcolor', 'Rodolia concolor', '(Lewis, 1879)', NULL, 'SPA_00446', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(446, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Coccinellidae', 'Bọ Rùa', 'FAM_095', 'Synonycha', NULL, 'GEN_1894', 'synonychagradis', 'Synonycha gradis', '(Thunberg, 1781)', NULL, 'SPA_00447', 'Con trưởng thành mới nở có màu vàng vàng, cánh trước mềm. Chúng ở trong vỏ nhộng cho đến khi cánh trở nên cứng cáp. Các đốm đen có thể nhìn thấy trên cánh trước sau khi xuất hiện. Elytra có màu vàng đến đỏ với các đốm đen. [9] Chiều dài cơ thể khoảng 13 mm và có hình bán cầu. Con cái lớn hơn con đực. ', NULL, ' Trung Quốc, Ấn Độ, Sri Lanka, Nepal, Indonesia, Nhật Bản, Malaysia, Philippines, Đài Loan, Úc, Trinidad và Tobago, Hoa Kỳ và Hawaii.', NULL, NULL, NULL, NULL, NULL, NULL, 'en.wikipedia.org'),
