(449, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Cucujidae', NULL, 'FAM_107', 'Cucujid', NULL, 'GEN_0501', 'cucujidsp1', 'Cucujid sp1', NULL, NULL, 'SPA_00450', 'hân dài song song với chiều dài từ 6 đến 25 mm. Hầu hết có màu nâu, trong khi một số khác có màu đen, đỏ hoặc vàng. Đầu có hình tam giác, với các râu dạng sợi đến dạng đơn gồm 11 anten và hàm dưới lớn . Đại từ hẹp hơn đầu', NULL, 'à một họ bọ cánh cứng đặc biệt được tìm thấy trên khắp thế giới (trừ Châu Phi và Nam Cực) dưới vỏ cây chết', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Cucujidae'),
