(452, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Curculionidae', 'Vòi Voi', 'FAM_110', 'Cosmopolites', NULL, 'GEN_0476', 'cosmopolitessordidus', 'Cosmopolites sordidus', '(Germar, 1824)', 'Sâu vòi voi', 'SPA_00453', 'Là một loại bọ cánh cứng đầu dài, có màu nâu đen hoặc màu xám đen, cơ thể hình bầu dục, dài khoảng 12-16 ly, chiều ngang khoảng 3-4 ly, và có vòi dài khoảng 3 ly, chúng hoạt động và đẻ trứng vào ban đêm, ít khi bay mà thường di chuyển bằng cách bò. Con trưởng thành có thể sống tới 2 năm. ', NULL, ' Nam Á, Châu Phi, Macaronesia , Úc, Nam và Trung Mỹ, Tây Ấn và Mexico. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vi.wikipedia.org'),
(453, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Curculionidae', 'Vòi Voi', 'FAM_110', 'Curculionid', NULL, 'GEN_0510', 'curculionidsp', 'Curculionid sp.', NULL, NULL, 'SPA_00454', 'Họ Curculionidae trưởng thành có thể được nhận biết nhờ mõm phát triển tốt, cong xuống ( mõm ) của nhiều loài, mặc dù mõm đôi khi ngắn (ví dụ Entiminae). [3] [4] Chúng có các râu hình khuỷu và kết thúc thành hình chùy, và đoạn râu đầu tiên thường khớp với một rãnh ở bên cạnh của mõm. [3] [4] Cơ thể có xu hướng khỏe mạnh, lồi lõm, xơ cứng nhiều và được bao phủ bởi vảy hoặc lông. [3] Họ Curculionidae có kích thước dài từ 1-35 mm, thường dài 5-15 mm. [4] Hầu hết các loài Curculionidae đều lưỡng hình giới tính với con cái (so với con đực) có râu ở vị trí cơ bản hơn và mõm dài hơn, mỏng hơn', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Curculionidae'),
