(568, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lampyridae', 'Đom Đóm', 'FAM_208', 'Archiphanurus', NULL, 'GEN_0146', 'archiphanurusirritus', 'Archiphanurus irritus', 'Le, 1980', 'Ong archiphanurus irritus', 'SPA_00569', 'Ong cái: Đầu có chiều rộng lớn hơn chiều dài 2,6 lần. Đỉnh đầu sau mắt đơn sau không gấp khúc đột ngột, không có gờ sắc. Trán không lõm ở giữa, giữa 2 hố râu đến mắt đơn trớc có 1 gờ dọc, hai bên gờ trơn bóng, các đờng rãnh dọc ở 2 bên trán không rõ ràng. Đỉnh đầu có vân hình hạt, má có những đờng rãnh xếp thành hình dẻ quạt. Mắt đơn sau không nằm sát với mép mắt kép. Mắt kép hình ôvan, không có lông rõ ràng. Râu 11 đốt, hình chùy. Đốt gốc râu có chiều dài lớn hơn chiều rộng 5 lần và 2,5 lần dài hơn đốt râu 2. Đốt râu 3 - 6 ngắn dần. Chiều rộng của đốt râu 6 lớn hơn chiều dài của đốt này. Chùy râu 5 đốt, chiều dài và chiều rộng của các đốt chùy lớn hơn chiều dài và chiều rộng của đốt gốc râu. Ngực có chiều dài lớn hơn chiều rộng, chiều rộng của nó lớn hơn chiều rộng của bụng, nhng chiều dài của ngực ngắn hơn chiều dài của bụng. Tấm lng ngực giữa có 2 rãnh lng rất ngắn và nhỏ ở phía sau, hầu nh không rõ. Trên tấm lng ngực giữa và scutellum có vân hình mạng lới nhỏ. Cánh trớc có chiều dài lớn hơn chiều rộng của ngực 3 lần, gân postmarginal dài hơn gân stigmal 1,5 lần. Cánh sau hẹp, lông diềm của nó gân bằng chiều rộng lớn nhất của cánh này Ký sinh trong trứng Coptosoma sp', NULL, 'Bắc Bộ ', NULL, NULL, 'Có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
(569, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lampyridae', 'Đom Đóm', 'FAM_208', 'Archiphanurus', NULL, 'GEN_0146', 'archiphanuruslongus', 'Archiphanurus longus', 'Kozlov et Le, 1997', 'Ong archiphanurus longus', 'SPA_00570', 'Ong cái: Đầu nằm ngang, có chiều rộng lớn hơn chiều dài 2,3 lần, hơi rộng hơn ngực. Mắt đơn sau nằm cách xa mắt kép một khoảng cách không lớn hơn khoảng cách giữa mắt đơn sau và mắt đơn trớc. Đỉnh đầu sau mắt đơn sau không gấp khúc đột ngột không có gờ sắc. Đỉnh đầu có vân dạng hạt nhỏ. Trán không lõm ở giữa, hai bên trán ở gần mép mắt kép có những đờng vân dọc kéo dài đến má và đến gốc hàm trên. Mắt kép ở dộ phóng đại 56 hầu nh không có lông. Râu 11 đốt, hình chùy. Đốt gốc râu có chiều dài lớn hơn chiều rộng 5 lần, dài hơn radicle 3 lần và 2,5 lần dài hơn đốt râu 2. Các đốt 3 - 6 ngắn dần. Chùy râu 5 đốt, tổng chiều dài của các đốt chùy lớn hơn chiều dài của đốt gốc râu. Ngực có chiều dài bằng chiều rộng. Tấm lng ngực giữa có 2 rãnh lng ở phía sau. Trên tấm lng ngực giữa và scutellum có vân dạng hạt nhỏ. Cánh trớc có chiều dài lớn hơn chiều rộng khoảng 3 lần và lớn hơn chiều rộng của ngực 2,8 lần, gân postmarginal dài hơn gân stigmal ', NULL, 'Bắc Bộ ', NULL, NULL, 'Có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
(570, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lampyridae', 'Đom Đóm', 'FAM_208', 'Archiphanurus', NULL, 'GEN_0146', 'archiphanurusobtusus', 'Archiphanurus obtusus', 'Le, 1982', 'Ong archiphanurus obtusus', 'SPA_00571', 'Ong cái: Đầu nằm ngang, có chiều rộng lớn hơn chiều dài 2 lần, hơi rộng hơn ngực. Đỉnh đầu sau mắt đơn sau không gấp khúc đột ngột, không có gờ sắc. Trán ở giữa không lõm, trơn và không có đờng vân dọc. Mắt kép hình ôvan, có chiều dài lớn hơn chiều rộng và không có lông. Đỉnh đầu và 2 bên trán gần mép mắt kép có những đờng vân dọc xếp thành hình dẻ quạt. Râu 11 đốt, hình chùy. Đốt gốc có chiều dài lớn hơn chiều rộng 5 lần, 4 lần dài hơn radicle. Đốt râu 2 dài và rộng hơn đốt râu 3. Đốt râu 3 dài hơn đốt râu 4 và 5. Đốt râu 6 ngắn nhất, có chiều dài gần bằng chiều rộng. Chùy râu 5 đốt, tổng chiều dài của các đốt chùy dài hơn chiều dài của đốt gốc râu. Mối tơng quan giữa chiều dài và chiều rộng của các đốt chùy nh sau: đốt 7 - 2: 2,5; 8 - 2,5:3; 9 - 2,5:3; 10 - 2,5:3; 11 - 3,5:2,5 Ký sinh trong trứng Bọ Xít Coptosoma sp', NULL, 'Bắc Bộ ', NULL, NULL, 'Có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
(571, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lampyridae', 'Đom Đóm', 'FAM_208', 'Baeus', NULL, 'GEN_0197', 'baeussenus', 'Baeus senus', NULL, 'Ong baeus senus', 'SPA_00572', 'Ong đực: Đầu có chiều rộng lớn hơn chiều dài 2,5 lần. Đỉnh đầu sau mắt đơn sau và mắt kép gấp khúc đột ngột, có gờ ngang. Trán ở giữa không lõm. Mắt đơn sau nằm gần mép mắt kép. Mắt kép hình ôvan, có chiều dài lớn hơn chiều rộng và lớn hơn chiều dài của má, không có lông. Đỉnh đầu và trán có vân dạng hạt nhỏ. Râu 12 đốt, hình sợi. Đốt gốc râu có chiều dài lớn hơn chiều rộng 4 lần và 2,6 lần dài hơn đốt râu 2. Đốt râu 2 dài hơn đốt râu 3. Các đốt râu từ 3 - 10 có chiều rộng và chiều dài bằng nhau (gần nh hình vuông), đốt râu 11 và 12 có chiều dài lớn hơn chiều rộng, 2 đốt này có chiều dài bằng nhau và lớn hơn chiều dài của đốt râu 10. Ngực có chiều dài và chiều rộng bằng nhau, nhỏ hơn chiều rộng của đầu. Tấm lng ngực giữa không có rãnh lng. Scutellum hình bán cầu, lồi rất nhiều, hầu nh phồng lên. Tấm lng ngực giữa, tấm bên ngực giữa, ngực sau có vân dạng hạt nhỏ. Cánh trớc hẹp, có chiều dài lớn hơn chiều rộng 4 lần và 2,7 lần lớn hơn chiều rộng của ngực. Cánh này có gân postmarginal tiêu giảm, gân stigmal dài hơn gân marginal 2 lần Sống ở ruộng lúa', NULL, 'Bắc Bộ ', NULL, NULL, 'Có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
(572, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lampyridae', 'Đom Đóm', 'FAM_208', 'Calliscelio', NULL, 'GEN_0287', 'callisceliourgo', 'Calliscelio urgo', 'Kozlov et Le in lit.', 'Ong calliscelio urgo', 'SPA_00573', 'Ong cái: loài này có hình dạng kích thước và nhiều đặc điểm giống như Calliscelio hubo Kozlov et Le như kích thước của đầu, ngực và các đốt bụng, cánh trớc có gân postmarginal dài hơn stigmal 1,5 lần các ống chân giữa và chân sau không có lông dài, chân màu vàng ', NULL, ' ', NULL, NULL, 'Có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
(573, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lampyridae', 'Đom Đóm', 'FAM_208', 'Ceratobaeus', NULL, 'GEN_0345', 'ceratobaeusclavus', 'Ceratobaeus clavus', 'Kozlov et Le in lit.', 'Ong ceratobaeus clavus', 'SPA_00574', 'Ong cái: Đầu có chiều rộng lớn hơn chiều dài 2,5 lần. Đỉnh đầu sau mắt đơn sau gấp khúc đột ngột, có gờ ngang sắc. Trán ở giữa không lõm. Mắt kép hình ôvan, có chiều dài lớn hơn chiều rộng, dài bằng chiều dài của má. Mắt kép không có lông rõ ràng. Đỉnh đầu có vân dạng hạt nhỏ, trán trên hố râu trơn bóng. Má có những đờng vân xếp thành hình dẻ quạt. Râu 7 đốt, hình chùy. Đốt gốc râu có chiều dài lớn hơn chiều rộng 4,4 lần, 3,3 lần dài hơn radicle và 2,7 lần dài hơn đốt râu 2. Đốt râu 2 có chiều dài lớn hơn chiều rộng 1,6 lần và dài hơn đốt râu 3. Các đốt râu 4 - 6 dài bằng nhau, chiều rộng của từng đốt lớn hơn chiều dài của chính đốt ấy. Chùy râu có chiều dài lớn hơn chiều rộng 2,2 lần và dài bằng chiều dài của đốt gốc râu. Ngực có chiều dài bằng chiều rộng, hơi rộng hơn bụng và hẹp hơn đầu. Tấm lng ngực giữa không có rãnh lng. Trên tấm lng này và scutellum có vân dạng hạt nhỏ. Tấm bên của ngực giữa và ngực sau trơn bóng. Cánh trớc có chiều dài lớn hơn chiều rộng 2,7 lần và 2,3 lần lớn hơn chiều rộng của ngực, gân postmarginal dài hơn gân stigmal 1,4 lần và 2,3 lần dài hơn gân marginal; gân stigmal dài hơn gân marginal 1,7 lần Mẫu vật thu ở đường đi ven rừng', NULL, ' ', NULL, NULL, 'Có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
(574, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lampyridae', 'Đom Đóm', 'FAM_208', 'Ceratobaeus', NULL, 'GEN_0345', 'ceratobaeuscrossus', 'Ceratobaeus crossus', 'Kozlov et Le in lit.', 'Ong ceratobaeus crossus', 'SPA_00575', 'Ong cái: Đầu có chiều rộng lớn hơn chiều dài 2 lần, rộng bằng ngực. Đỉnh đầu sau mắt đơn sau và mắt kép gấp khúc đột ngột, có gờ ngang. Thái dơng hẹp, chiều rộng của nó chỉ bằng 1/3 chiều rộng của mắt kép. Trán ở giữa không lõm. Mắt đơn sau nằm gần mép mắt kép, khoảng cách giữa chúng bằng đờng kính của mắt đơn này. Mắt kép hầu nh không có lông, có dạng hình ôvan, có chiều dài lớn hơn chiều rộng (12:9). Chiều dài của mắt kép lớn hơn chiều dài của má. Má có những đờng vân xiên từ mép dới của mắt kép đến gốc hàm trên tạo thành hình dẻ quạt. Bề mặt của đầu có vân hình hạt nhỏ, mịn. Râu 7 đốt, hình chùy. Đốt gốc có chiều dài lớn hơn chiều rộng 5 lần, dài hơn radicle 3,7 lần và 3 lần dài hơn đốt râu 2. Đốt râu 3 ngắn hơn đốt râu 2, các đốt 4 - 6 ngắn dần, đốt râu 6 có chiều rộng lớn hơn chiều dài. Chùy râu có 1 đốt, có chiều dài lớn hơn chiều rộng 2,3 lần, dài hơn chiều dài của đốt gốc râu. Trên chùy râu có những đờng xoắn ngang nh là ranh giới của các đốt râu hay là các đờng lông cảm giác của râu ', NULL, 'Bắc Bộ ', NULL, NULL, 'Có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
(575, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lampyridae', 'Đom Đóm', 'FAM_208', 'Ceratobaeus', NULL, 'GEN_0345', 'ceratobaeusleteres', 'Ceratobaeus leteres', 'Kozlov et Le in lit.', 'Ong ceratobaeus leteres', 'SPA_00576', 'Ong cái: Đầu có chiều rộng lớn hơn chiều dài khoảng 2 lần, hơi rộng hơn ngực. Đỉnh đầu sau mắt đơn sau và mắt kép gấp khúc đột ngột, có gờ ngang sắc. Thái dơng sau mắt kép hẹp, chiều rộng của nó không bằng 1/3 chiều rộng của mắt kép. Trán ở giữa không lõm. Mắt đơn sau nằm gần sát mép mắt kép, khoảng cách giữa chúng không lớn hơn đờng kính của mắt đơn này. Mắt kép nhỏ, gần nh tròn, không có lông. Đờng kính của mắt kép gần nh bằng chiều dài của má (8: 8). Bề mặt của đầu có vân dạng hạt nhỏ. Râu 7 đốt, hình chùy. Đốt gốc râu có chiều dài lớn hơn chiều rộng khoảng 4 lần và 3 lần dài hơn đốt râu 2. Đốt râu 2 dài hơn đốt râu 3. Các đốt 4 - 6 ngắn dần. Đốt râu 6 có chiều rộng lớn hơn chiều dài. Chùy râu có chiều dài lớn hơn chiều rộng 2 lần, nhỏ hơn chiều dài của đốt gốc râu. Ngực có chiều dài không lớn hơn chiều rộng. Nửa sau của tấm lng ngực giữa có 2 rãnh lng. Ngực sau hẹp và hơi lõm ở giữa. Cánh trớc ngắn, có chiều dài lớn hơn chiều rộng của ngực 1,3 lần, cánh có lông diềm dài, chiều dài lớn nhất của lông lớn hơn chiều rộng lớn nhất của cánh này, gân postmarginal và marginal ngắn, chiều dài của chúng ngắn hơn chiều dài của gân stigmal. Cánh sau ngắn và hẹp, nó cũng có lông diềm cánh dài nh lông diềm của cánh trước ', NULL, 'Bắc Bộ ', NULL, NULL, 'Có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
(576, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lampyridae', 'Đom Đóm', 'FAM_208', 'Lamellipalpus', NULL, 'GEN_1018', 'lamellipalpusconstantini', 'Lamellipalpus constantini', 'Brancucci & Geiser, 2007', 'Đom đóm cánh xanh', 'SPA_00577', 'Cơ thể thuôn dài, màu nâu gạch có xúc tu, râu và cánh trước màu nâu sẫm đến đen. Mặt dưới hoàn toàn màu nâu gạch. Con đực có đầu gập xuống, bạnh ngang, ngắn. Khoảng cách từ mắt đến mảnh lưng đốt ngực trước bằng với đường kính của một mắt. Mắt cỡ trung bình, đường kính bằng 1/3 khoảng cách giữa hai mắt. Bề mặt sáng, phủ một lớp lông vàng mịn và có li ti lỗ kim. Hàm dài, hơi lệch. Đốt cuối của xương hàm và xúc tu phẳng và thon dài, chỉ dài hơn một chút so với hàm, có lông tơ mịn. Lông tơ dày, mịn, màu nâu gạch. Râu ngắn, khớp thứ 1 và thứ 3 thuôn dài, khớp thứ 2 rất nhỏ. Khớp thứ 4 dài và rộng một chút. Khớp thứ 5 đến 11 hầu như không dài hơn rộng. Mảnh lưng trước màu nâu gạch, bạnh ngang, nhạt dần phía sau lưng trước góc thân. Các góc lưng sau lồi ra. Trọn bề mặt sáng có những vết lõm nhỏ đi kèm với từng sợi lông tơ dài và mịn. Vảy nhỏ, hình tam giác và có màu nâu gạch. Đôi cánh trước màu nâu sẫm đến đen, rộng nhất ở nửa sau với 3 gân sườn cánh tách biệt và lỗ thô. Phần lỗ thô rộng và gần sát hơn với đường kính thân của chúng. Lông tơ dày. Tơ cứng ngắn, mịn và đen. Viền cánh trước rộng và bo cứng. Mặt dưới hoàn toàn màu nâu gạch, lông tơ dày mịn. Loài này có quan hệ gần gũi với loài L. nigripennis. Loài phát hiện sau có đầu ngắn và khoảng cách mắt đến mảnh lưng đốt ngực trước ngắn hơn đường kính mắt. Hơn nữa, xúc tu của loài L. nigripennis màu nâu gạch và được phủ một lớp lông mịn và dày, dài hơn hàm ', NULL, 'QG Cúc Phương ', NULL, 'Loài đặc hữu, mới được phát hiện năm 2007 ở Vườn quốc gia Cúc Phương, Ninh Bình', 'Có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
(577, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lampyridae', 'Đom Đóm', 'FAM_208', 'Lampyrid', NULL, 'GEN_1026', 'lampyridsp', 'Lampyrid sp', NULL, NULL, 'SPA_00578', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(578, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lampyridae', 'Đom Đóm', 'FAM_208', 'Oculogryphus', NULL, 'GEN_1351', 'oculogryphusfulvus', 'Oculogryphus fulvus', 'Jeng, 2007', 'Đom đóm nâu đậm', 'SPA_00579', 'Loài này có một vài đặc điểm khác với các loài điển hình Oculogryphus bicolor. Chiều dài cơ thể lớn hơn (6.2 - 8.2 mm so với 6.0 mm), có sự kết hợp giữa hai màu nâu sáng và sạm nắng nhìn bóng bẩy hơn, cánh trước rộng hơn, đường lẽ đôi MP3+4 ở cánh sau, đốt sau mảnh hơn, cơ quan sinh dục ngoài thon dài hơn ở con đực. Con đực. BL: 6.2 - 8.2 mm; BW: 2.7 - 3.4 mm; PW/PL = 1.5 - 1.6; EL/ EW = 3.6 - 3.8; EL/PL = 3.8 - 4.4; BW/PW = 1.4 - 1.5. Loài này khá giống với loài đặc trưng về hình thái học Oculogryphus bicolor, ngoại trừ những khác biệt đã nêu ở trên nên không lặp lại ở đây. Như đã miêu tả, Oculogryphus fulvus ngoại trừ: thuỳ sinh dục dài 0.8 mm và rộng 0.6 mm, đốt bụng IX và X tách biệt rõ ràng, vòi giao phối dài khoảng 0.75 và rộng 0.4 mm. Thuỳ sinh dục tương đối thon dài ', NULL, 'QG Cúc Phương ', NULL, 'Loài đặc hữu, mới được phát hiện năm 2007 ở Vườn quốc gia Cúc Phương, Ninh Bình', 'Có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
(579, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Languriidae', 'Giả Bổ Củi', 'FAM_209', 'Caenolanguria', NULL, 'GEN_0274', 'caenolanguriainsularis', 'Caenolanguria insularis', 'Miwa et Chujo', '', 'SPA_00580', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(580, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Languriidae', 'Giả Bổ Củi', 'FAM_209', 'Langurid', NULL, 'GEN_1028', 'languridsp', 'Langurid sp', NULL, NULL, 'SPA_00581', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(581, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lucacidae', 'Sừng Hươu', 'FAM_223', 'Dorcustitanus', NULL, 'GEN_0603', 'dorcustitanuswestermani', 'Dorcustitanus westermani', 'Hope, 1842', NULL, 'SPA_00582', 'Loài bọ cánh cứng kích thước lớn: con đực tới trên 80mm, có màu đen tuyền. Thân hình rất giống với loài Kẹp kìm sừng cong (dorcus curvidens curvidens), chỉ khác hình thái cặp sừng. Sừng có hình dạng như lưỡi thanh long đao, mặt trong của \"lưỡi đao\" có hình răng cưa. Răng to nhất nằm ở vị trí trong khoảng 1/3 độ dài của sừng kể từ gốc sừng. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(582, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lucacidae', 'Sừng Hươu', 'FAM_223', 'Figulus', NULL, 'GEN_0716', 'figulusbinodulus', 'Figulus binodulus', 'Waterhouse, 1873', NULL, 'SPA_00583', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(583, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lucacidae', 'Sừng Hươu', 'FAM_223', 'Figulus', NULL, 'GEN_0716', 'figuluscaviceps', 'Figulus caviceps', 'Boileau, 1902. ', NULL, 'SPA_00584', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(584, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lucacidae', 'Sừng Hươu', 'FAM_223', 'Neolucalus', NULL, 'GEN_1299', 'neolucalussinicus', 'Neolucalus sinicus', 'Saunders, 1854', NULL, 'SPA_00585', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(585, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lucacidae', 'Sừng Hươu', 'FAM_223', 'Odontolabis', NULL, 'GEN_1356', 'odontolabissiva', 'Odontolabis siva', '(Hope & Westwood 1845)', NULL, 'SPA_00586', 'Chiều dài cơ thể 45,5-75,5mm (bao gồm cả hàm trên). Toàn màu đen sáng. Đầu rộng và nằm ngang, con đực có một sừng trên mỗi má, mép trước của gốc môi nhọn, 10 râu và 3 que dẹp và rộng. Pronotum rộng và rộng, con đực có 1 gai mỗi bên, và lớp màng cứng có hình bán nguyệt. Các elytra trơn, với các bản khắc nhỏ nằm rải rác ở mặt trước. Bàn chân mập mạp, có xương chày trước bằng phẳng và rộng, mép ngoài có 5 răng nhỏ, 5 mấu và các móng vuốt cong lớn. Chiều dài và hình dạng răng của hàm trên rất khác nhau giữa các con đực do kích thước cơ thể khác nhau. Con cái có hàm trên ngắn và rộng. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(586, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lucacidae', 'Sừng Hươu', 'FAM_223', 'Prosopocoilus', NULL, 'GEN_1635', 'prosopocoilusbiplagiatus', 'Prosopocoilus biplagiatus', '(Westwood, 1855)', NULL, 'SPA_00587', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(587, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lucacidae', 'Sừng Hươu', 'FAM_223', 'Prosopocoilus', NULL, 'GEN_1635', 'prosopocoilusbuddha', 'Prosopocoilus buddha', 'Hope, 1842', NULL, 'SPA_00588', 'có kích thước trung bình (con đực dài 26-63 mm), có bề ngoài rộng, bóng, màu nâu đỏ đến đen. Loài này rất khác nhau: những con đực lớn có thể có hàm dài, khá mỏng và hơi cong, có một chiếc răng ở chân răng, một chiếc răng lớn hơn một chút ở ngay bên ngoài giữa và một số răng nhỏ hơn. Những con đực nhỏ thường có hàm ngắn, hình dao và lởm chởm. Đầu to, rộng, không điêu khắc, râu có hình quạt ba dây. Đại từ rộng hơn đáng kể so với chiều dài, không thu hẹp ở gốc. Mặt dưới cùng màu với mặt trên và chân có màu nâu sẫm đến đen. Con cái nhỏ hơn, rộng hơn và sáng hơn, không có hàm to. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'en.wikipedia.org'),
(588, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lucacidae', 'Sừng Hươu', 'FAM_223', 'Prosopocoilus', NULL, 'GEN_1635', 'prosopocoilusconfucius', 'Prosopocoilus confucius', '(Hope, 1842)', NULL, 'SPA_00589', 'Kích thước lớn, có màu đen bóng; hàm trên kéo dài cong hướng vào trong, có một răng lớn mập ở sát gốc, một dãy răng nhỏ phân bố thưa thớt từ giữa đến đầu ngọn; tấm ngực trước đặc trưng bởi các góc trước bị cắt cụt; kích thước con đực từ 59 đến 106 mm; con cái từ 40 đến 46mm. Với kích thước này, đây là loài kẹp kìm có kích thước đạt giới hạn lớn nhất trong tất cả các loại kẹp kìm đã được phát hiện ở Việt Nam ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(589, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lucacidae', 'Sừng Hươu', 'FAM_223', 'Prosopocoilus', NULL, 'GEN_1635', 'prosopocoilusdenticulatus', 'Prosopocoilus denticulatus', 'Boileau, 1901', NULL, 'SPA_00590', 'Kích thước lớn, có màu đen bóng; hàm trên kéo dài cong hướng vào trong, có một răng lớn mập ở sát gốc, một dãy răng nhỏ phân bố thưa thớt từ giữa đến đầu ngọn; tấm ngực trước đặc trưng bởi các góc trước bị cắt cụt; kích thước con đực từ 59 đến 106 mm; con cái từ 40 đến 46mm. Với kích thước này, đây là loài kẹp kìm có kích thước đạt giới hạn lớn nhất trong tất cả các loại kẹp kìm đã được phát hiện ở Việt Nam ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(590, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lucacidae', 'Sừng Hươu', 'FAM_223', 'Prosopocoilus', NULL, 'GEN_1635', 'prosopocoilusspineus', 'Prosopocoilus spineus', '(Didier, 1927)', NULL, 'SPA_00591', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(591, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lucacidae', 'Sừng Hươu', 'FAM_223', 'Prosopocoilus', NULL, 'GEN_1635', 'prosopocoilussuturalis', 'Prosopocoilus suturalis', '(Olivier, 1789)', NULL, 'SPA_00592', 'Kích thước lớn; hàm trên kéo dài cong hướng vào trong, có một răng lớn mập ở sát gốc, một dãy răng nhỏ phân bố thưa thớt từ giữa đến đầu ngọn; tấm ngực trước đặc trưng bởi các góc trước bị cắt cụt; kích thước con đực từ 59 đến 106 mm; con cái từ 40 đến 46mm. Với kích thước này, đây là loài kẹp kìm có kích thước đạt giới hạn lớn nhất trong tất cả các loại kẹp kìm đã được phát hiện ở Việt Nam ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(592, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Lucanidae', 'Cặp Kìm', 'FAM_224', 'Lucanidae', NULL, 'GEN_1115', 'lucanidaesp', 'Lucanidae sp.', NULL, NULL, 'SPA_00593', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(593, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Meloidae', 'Thầy Cúng', 'FAM_239', 'Epicauta', NULL, 'GEN_0659', 'epicautagorhami', 'Epicauta gorhami', 'Marseul', '', 'SPA_00594', 'Loài ban miêu có kích thước nhỏ hơn so với ban miêu khoang đen hồng lớn Mylabrini phalerata. Cơ thể chúng có màu đen trừ phần đầu có màu đỏ, tròn. Cấu tạo bên ngoài vỏ đầu có nhiều lỗ chân lông cứng, thưa tạo thành những lỗ lõm. Khu trán chứa một đôi râu, chân râu nằm ngay sát với đôi mắt kép màu đen, vùng trán ở giữa hai râu không có lông cứng. Râu đầu của ban miêu mình đen đầu đỏ có hình sợi chỉ và có 11 đốt. Đốt chân râu có kích thước lớn nhất, đốt cuống râu có kích thước nhỏ nhất, các đốt roi râu hình ống dài gần bằng nhau và càng về cuối râu càng nhỏ dần. Các đốt gốc râu, cuống râu và đốt roi râu thứ nhất có lông bao phủ, các đốt roi râu còn lại trên bề mặt ko có lông bao phủ. Ban miêu mình đen đầu đỏ có kiểu miệng nhai nghiền. Phần phụ miệng của ban miêu mình đen đầu đỏ gồm có môi trên và môi dưới. Hàm dưới có 1 đôi xúc biện gồm 3 đốt. Dưới hàm ban miêu mình đen đầu đỏ có nhiều lông cứng.\n\nLưng ngực trước (pronotum) có hình quả lê, phần thót lại nối với đầu tạo thành khấc cổ rõ rệt, phần phình to sát với gốc cánh, sát scutellum bằng mảnh kitin rất nhỏ màu đen hình bán nguyệt. Hai đốt ngực sau được che bởi đôi cánh cứng dài đến hết cơ thể. Mặt bụng thấy rõ rệt ba đốt ngực, trên mỗi đốt ngực có một đôi chân. Chân của ban miêu mình đen đầu đỏ là dạng chân chạy. Mỗi chân gồm 5 đốt, bàn chân cấu tạo 5-5-4 và có một đốt cuối tạo thành 2 vuốt. Trên chân có rất nhiều lông cứng, bàn chân có lông nhỏ phủ kín. Đôi cánh cứng có màu đen tuyền cả mặt trong và mặt ngoài, ngoài tác dụng bảo vệ cho cơ\n\nthể thì còn giúp cho ban miêu có thể dễ dàng lẩn trốn kẻ thù. Mặt trong của cánh có màu đen. Trên đôi cánh cứng có nhiều gân, đặc biệt nhìn mặt trong của cánh có thể thấy rõ hơn những gân cánh đó. Bề mặt của cánh có lớp lông mịn khá dày.\n\nMặt bụng có thể thấy được 6 đốt rõ rệt, thuôn nhỏ từ đốt đầu đến đốt cuối. Đốt cuối tạo thành mảnh trên và mảnh dưới che đi cơ quan sinh sản. Mặt lưng bụng bóng mịn và có màu đen. Các tấm bụng màu đen được kitin hóa tạo nên các tấm cứng. Giữa các tấm đốt bụng có nối ngăn cách, theo các gờ nối là các riềm lông đen mảnh. Các tấm bụng hơi gồ lên tạo thành gờ nổi cao chạy dọc cơ thể, gờ này giúp cho phần bụng có thể căng phồng lên hay xẹp xuống khi hô hấp. Hai bên bụng có 2 hàng lỗ thở dọc theo bụng. Loài này thường gây hại trên Lúa Oryza sativa, Khoai lang ipomoea batatas, Sắn Manihot esculenta, Đậu phọng Arachis hypogaea, Đậu nành Glycine max, Cam Citrus  sinensis, Cà phê Coffea sp., Bông Gossypium herbaceum, Bầu bí Lagenaria siceraria, Mướp Luffa cylindrica và cây rừng từ tháng 5 đến tháng 11. Giống như loài Ban miêu đầu đỏ Mylabrini phalerata đây là loài côn trùng gây hại rất lớn đến các loại cây trồng. Chúng có rất ít loài thiên địch vì cơ thể chúng có độc tố và gây hại mùa màng chủ yêu vào ban đêm.', NULL, 'Sơn La, Vĩnh Phúc, Bắc Giang, Hà Tây, Hải Hưng, Hòa Bình, Quảng Ninh, Ninh Bình vào tới Thanh Hóa, Nghệ An... và còn phân bố ở Hà Tĩnh, Quảng Trị, Đồng Nai, Bình Phước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
