(597, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Meloidae', 'Thầy Cúng', 'FAM_239', 'Meloid', NULL, 'GEN_1198', 'meloidsp1', 'Meloid sp1', NULL, NULL, 'SPA_00598', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(598, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Meloidae', 'Thầy Cúng', 'FAM_239', 'Mylabris', NULL, 'GEN_1270', 'mylabriscichorii', 'Mylabris cichorii', 'Lin.', '', 'SPA_00599', 'Ban miêu khoang vàng nhỏ dài từ 10 - 15mm, thân hơi khum màu đen với các điểm hay dải ngang màu vàng hay đỏ nhạt, có khi thân màu vàng với các điểm hay dải ngang màu đen, Đầu hình tròn tam giác. Râu đen hình sợi gồm 11 đốt, đốt cuối phình lớn lên, có đốt nền và đốt trước giống nhau, đốt cuống râu có kích thước nhỏ nhất, các đốt roi râu hình ống dài gần bằng nhau và càng về cuối râu càng nhỏ dần. Các đốt gốc râu, cuống râu và đốt roi râu thứ nhất có lông bao phủ, các đốt roi râu còn lại trên bề mặt ko có lông bao phủ. Loài này có kiểu miệng nhai nghiền.\nNhìn từ mặt lƣng, tấm lƣng ngực trước (pronotum) có hình quả lê, phần thót lại nối với đầu tạo thành khấc cổ rõ rệt, phần phình to sát với gốc cánh, sát scutellum bằng mảnh kitin rất nhỏ màu đen hình bán nguyệt. Hai đốt ngực sau đƣợc che bởi đôi cánh cứng dài đến hết cơ thể. Nhìn mặt bụng thấy rõ rệt ba đốt ngực, trên mỗi đốt ngực có một đôi chân. Chân của chúng là dạng chân chạy. Mỗi chân gồm 5 đốt, bàn chân cấu tạo 5 - 5 - 4 và có một đốt cuối tạo thành 2 vuốt. Loài này thường gây hại trên Lúa Oryza sativa, Khoai lang ipomoea batatas, Sắn Manihot esculenta, Đậu phọng Arachis hypogaea, Đậu nành Glycine max, Cam Citrus  sinensis, Cà phê Coffea sp., Bông Gossypium herbaceum, Bầu bí Lagenaria siceraria, Mướp Luffa cylindrica và cây rừng từ tháng 5 đến tháng 11. Giống như loài Ban miêu đầu đỏ Mylabrini phalerata đây là loài côn trùng gây hại rất lớn đến các loại cây trồng. Chúng có rất ít loài thiên địch vì cơ thể chúng có độc tố và gây hại mùa màng chủ yêu vào ban đêm.', NULL, 'Loài này phân bố rộng khắp các tỉnh Sơn La, Vĩnh Phúc, Bắc Giang, Hà Tây, Hải Hưng, Hòa Bình, Quảng Ninh, Ninh Bình vào tới Thanh Hóa, Nghệ An... và còn phân bố ở Hà Tĩnh, Quảng Trị, Đồng Nai, Bình Phước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
