(621, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Scarabaeidae', 'Bọ Hung', 'FAM_329', 'Apogonia', NULL, 'GEN_0135', 'apogoniabicarinata', 'Apogonia bicarinata', 'Lewis.', '', 'SPA_00622', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(622, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Scarabaeidae', 'Bọ Hung', 'FAM_329', 'Bliopertha', NULL, 'GEN_0228', 'blioperthaorientalis', 'Bliopertha orientalis', '(Waterh.)', '', 'SPA_00623', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(623, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Scarabaeidae', 'Bọ Hung', 'FAM_329', 'Catharsius', NULL, 'GEN_0330', 'catharsiusmolossus', 'Catharsius molossus', '(Linnaeus, 1758)', NULL, 'SPA_00624', 'Chiều dài cơ thể là 23,7-40 mm và chiều rộng là 16,8-23 mm. Bọ cánh cứng lớn, ngắn và rộng, hình bầu dục, rất tròn trên lưng, màu đen hoặc nâu sẫm (xem hình). Đầu to, có nhiều vảy chạm khắc theo chiều ngang và dài, gốc của môi và quá trình có gai hình quạt, cơ thể con đực có sừng mọc cặp hình chiếu nhỏ ở mặt sau của gốc sừng; phần giữa của đầu và mặt của con cái rất nhô lên, Phần trên có gờ theo chiều ngang và phần giữa lồi ra ít nhiều. Ăng ten 9 đoạn, mang đầu cuối 3 đoạn ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(624, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Scarabaeidae', 'Bọ Hung', 'FAM_329', 'Catharsius', NULL, 'GEN_0330', 'catharsiussp', 'Catharsius sp', NULL, NULL, 'SPA_00625', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(625, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Scarabaeidae', 'Bọ Hung', 'FAM_329', 'Chalcosoma', NULL, 'GEN_0360', 'chalcosomaatlas', 'Chalcosoma atlas', 'Lin', 'Bọ hung ba sừng', 'SPA_00626', 'Loài bọ cánh cứng có kích thước lớn, con đực có chiều dài tới trên 70mm. Toàn thân có màu đen bóng, trừ mắt và lông vùng miệng màu vàng nâu. Phần đầu và lưng trước liền khối với 3 sừng to dài, nhọn đầu và 1 sừng ngắn, nhỏ, nhọn nằm giữa 3 sừng to. Hai sừng hai bên nằm về phía sau (trên), đối xứng nhau và cong vút vào trong như hai ngà voi. Sừng phía trước cong gập về phía sau, giữa phần gập phía trong có một bướu tù to. Những chiếc sừng đã góp phần tạo hình dáng đặc sắc cho con vật và chúng trở nên có giá trị rõ rệt về mặt thẩm mỹ. Độ dài của phần được cánh cứng bao phủ và phần lưng trước cộng sừng gần bằng nhau. Con cái có kích thước nhỏ hơn và không có sừng. Loài thích sống ở rừng ẩm nhiệt đới gần xích đạo thuộc Đông Nam châu Á.', NULL, 'Trung bộ (Lâm Đồng: Bảo Lộc), Nam bộ (Vườn quốc gia Cát Tiên). Đông Bắc Ấn Độ, Thái Lan, Inđônêxia (Sumatra), Philippin.', NULL, NULL, 'Là loài côn trùng cánh cứng có kích thước lớn, đẹp và rất hiếm nên đã và đang bị thu bắt tích cực để buôn bán ở Việt Nam và trên thị trường quốc tế.', 'CR', NULL, NULL, 'vncreatures.net'),
(626, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Scarabaeidae', 'Bọ Hung', 'FAM_329', 'Cheirotonus', NULL, 'GEN_0370', 'cheirotonusgestroi', 'Cheirotonus gestroi', 'Pouillaude', 'Cua bay', 'SPA_00627', 'Cơ thể con đực dài tới trên 50mm. Tấm lưng ngực trước có màu đen óng ánh, hai bên màu xanh, diềm bên có lông màu vàng. Cánh trên màu nâu đen, với những hàng chấm hoa, sọc màu vàng cam dọc trên cánh. Chân trước con đực phát triển, ống chân trước mảnh mai, dài và cong, đỉnh của nó có 1 gai dài chìa vào phía trong, giữa của ống chân có 1 gai ngắn (chỉ bằng 1/3 - 1/2  chiều dài của gai trước, ống chân giữa và sau bình thường, có nhiều gai ngắn. Con cái có kích thước nhỏ hơn con đực và có màu sắc giống con đực, nhưng chân trước không phát triển, ống chân trước ngắn và bờ ngoài của nó có gai dạng răng cưa. Chưa có tài liệu nghiên cứu sâu về thức ăn và ấu trùng của loài này. Chỉ bắt được cá thể trưởng thành xuất hiện vào ban đêm (bẫy đèn) tháng 4 đến tháng 6 ở vùng rừng núi có khí hậu lạnh và ở độ cao trên 1000m. Nơi sinh cảnh sống của chúng.', NULL, 'VQG Konkakinh, Chuyangsin, Chumomray, Ngọc Linh. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
