(631, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Scarabaeidae', 'Bọ Hung', 'FAM_329', 'Digitonthophagus', NULL, 'GEN_0583', 'digitonthophagusbonasus', 'Digitonthophagus bonasus', '(Fabricius 1775)', NULL, 'SPA_00632', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(632, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Scarabaeidae', 'Bọ Hung', 'FAM_329', 'Eupatorus', NULL, 'GEN_0689', 'eupatorusgracilicornis', 'Eupatorus gracilicornis', '(Arrow, 1908)', 'Bọ hung năm sừng', 'SPA_00633', 'Cơ thể đực dài 65 - 74,5mm,  cái dài 48 - 65,5mm. Đực: Cơ thể màu đen bóng, cánh trước màu nâu. Đỉnh đầu có sừng dài cong về phía sau phủ quá 1/2 tấm lưng ngực trước. Tấm lưng ngực trước có 4 sừng hướng về phía trước, 2 sừng ở 2 góc bên tấm lưng ngực trước dài hơn 2 sừng ở phía sau, 2 sừng sau nằm gần ở đỉnh của tấm lưng ngực trước. ống chân trước dài hơn các ống chân khác, mép ngoài của nó có 3 gai, mép trong có 1 gai ở đỉnh ống chân. Con cái có màu sắc giống con đực, nhưng đầu và ngực không có sừng Chỉ gặp ở những nơi có khí hậu ôn đới núi cao và chỉ gặp các cá thể trưởng thành. Chưa có các nghiên cứu chuyên sâu về nhộng hay thức ăn của ấu trùng trong tự nhiên', NULL, 'Bắc Bộ Lào, Thái Lan, Mianma', NULL, NULL, 'Có kích thước lớn, có màu đẹp và hình thù kỳ dị nên được ưa thích, hiện nay là đối tượng đang được sưu tầm để bán cho khách du lịch', 'VU A 1a,d D.', NULL, NULL, 'VN Creature'),
