(672, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Scarabaeidae', 'Bọ Hung', 'FAM_329', 'Trichogymphus', NULL, 'GEN_1982', 'trichogymphusmolgol', 'Trichogymphus molgol', 'Arrow', '', 'SPA_00674', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(673, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Scarabaeidae', 'Bọ Hung', 'FAM_329', 'Trypoxylus', NULL, 'GEN_2000', 'trypoxylusdichotomus', 'Trypoxylus dichotomus', '(Linnaeus, 1771)', 'Bọ Hung Sừng Chữ Y ', 'SPA_00675', 'Là một trong số các loài bọ cánh cứng có kích thước lớn với độ dài thân con đực 35~50mm. Toàn thân có mầu nâu  thẫm đến nâu đen. Sừng trước (dưới) to hơn rất nhiều và dài gấp hơn 3 lần sừng sau (trên). Cả hai sừng đều chẻ đôi trông giống chữ \"Y\", hai nhánh của sừng trước còn tiếp tục hơi phân đôi một lần nữa tạo thành chữ \"Y\" hoa. Con cái có kích thước nhỏ hơn và không có sừng. Sống trong môi trường rừng ẩm nhiệt đới ở độ cao trung bình đến rất cao.', NULL, 'Vĩnh Phúc (Tam Đảo) Đông Bắc Ấn Độ, Triều Tiên, Nhật Bản, Trung Quốc (Đài Loan, đảo Hải Nam), Lào (Trấn Ninh).', NULL, NULL, 'Loài côn trùng không chỉ có giá trị về nguồn gen, thẩm mỹ mà còn có giá trị thương mại vì vật mẫu của chúng là hàng hoá đã và đang được buôn bán trên thị trường quốc tế.', 'EN A1c,d C2a.', NULL, NULL, 'vncreatures.net'),
(674, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Scarabaeidae', 'Bọ Hung', 'FAM_329', 'Trypoxylus', NULL, 'GEN_2000', 'trypoxylussp1', 'Trypoxylus sp.1', NULL, NULL, 'SPA_00676', 'Là một trong số các loài bọ cánh cứng có kích thước lớn với độ dài thân con đực 35~50mm. Toàn thân có mầu nâu  thẫm đến nâu đen. Sừng trước (dưới) to hơn rất nhiều và dài gấp hơn 3 lần sừng sau (trên). Cả hai sừng đều chẻ đôi trông giống chữ \"Y\", hai nhánh của sừng trước còn tiếp tục hơi phân đôi một lần nữa tạo thành chữ \"Y\" hoa. Con cái có kích thước nhỏ hơn và không có sừng.', NULL, 'Bắc Bộ: Vĩnh Phúc (Tam Đảo)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=3&ID=465'),
(675, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Scarabaeidae', 'Bọ Hung', 'FAM_329', 'Xylotrupes', NULL, 'GEN_2057', 'xylotrupesgideon', 'Xylotrupes gideon', '(Linnaeus, 1767)', NULL, 'SPA_00677', 'Con đực lớn hơn con cái. Chúng có hai sừng chia đôi bằng chitin, một sừng ngực dày và một sừng nhỏ hơn, chúng dùng để loại bỏ đối thủ trong thời kỳ giao phối. Những con bọ này có màu đỏ sẫm, nâu sẫm hoặc đen sáng bóng. Đôi mắt nằm ở mỗi bên đầu. Khi bị quấy rầy, những con bọ này phát ra tiếng rít, tạo ra bằng cách cọ xát đầu bụng vào mép elytra. Con đực có đầu ngang, ít thủng; clypeus thon dài, thủng ít và nhỏ. Ăng-ten có 10 đoạn. Pronotum và scutellum bị thủng rất ít và nhỏ. Elytra và pygidium coriaceous, bị thủng một cách tinh vi và ít ỏi. Lưng của con cái có hình dáng thô ráp, với đại từ thô và có nhiều lỗ thủng. Pygidium rugose mịn. ', NULL, ' Ấn Độ, Sri Lanka, Thái Lan, Indonesia', NULL, NULL, NULL, NULL, NULL, NULL, 'gbif.org'),
(676, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'COLEOPTERA', 'CÁNH CỨNG', 'ORD_023', 'Staphylinidae', 'Ngài Tằm Trời', 'FAM_351', 'Paederus', NULL, 'GEN_1423', 'paederusfuscipes', 'Paederus fuscipes', 'Curtis, 1826.', NULL, 'SPA_00678', 'Loài côn trùng này có thân mình thon, dài như hạt thóc (dài 1-1,2 cm, ngang 2–3 mm), có hai màu đỏ và đen. Về mặt khoa học thì kiến ba khoang không thuộc họ kiến, nhưng vì nhìn giống con kiến nên người ta hay gọi với nhiều tên gọi khác nhau như kiến hoang, kiến kim, kiến lác, kiến gạo, cằm cặp, kiến nhốt, kiến cong', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Ki%E1%BA%BFn_ba_khoang'),
