(732, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Calliphoridae', 'Nhặng', 'FAM_055', 'Chrysomyia', NULL, 'GEN_0405', 'chrysomyiamegacephala', 'Chrysomyia megacephala', '(Fabricius, 1794)', NULL, 'SPA_00734', 'Ruồi trưởng thành phản chiếu màu xanh lam kim loại trên ngực và bụng và có gena hoặc má màu vàng.  Ấu trùng có kích thước khác nhau tùy theo tuổi và có hình dạng dày hơn về phía sau. C. megacephala có đôi mắt to màu đỏ, mắt đực ở gần nhau và mắt cái ở xa hơn. Cercus của con đực dài hơn con cái. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'en.wikipedia.org'),
