(734, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Calliphoridae', 'Nhặng', 'FAM_055', 'Chrysomyia', NULL, 'GEN_0405', 'chrysomyiapinguis', 'Chrysomyia pinguis', '(Walker, 1858).', NULL, 'SPA_00736', 'Phần trước ngực màu nâu, mắt giống đực có khoảng cách ngắn và có ranh giới rõ ràng, 2/3 trên có các mặt lớn và 1/3 dưới có các mặt nhỏ hơn, vùng mặt và hàm có màu xám xỉn và phần sau có lông đen. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'indiabiodiversity.org'),
(735, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Calliphoridae', 'Nhặng', 'FAM_055', 'Chrysomyia', NULL, 'GEN_0405', 'chrysomyiarufifacies', 'Chrysomya rufifacies', '(Macquart, 1844)', NULL, 'SPA_00737', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(736, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Calliphoridae', 'Nhặng', 'FAM_055', 'Chrysomyia', NULL, 'GEN_0405', 'chrysomyiathamnothini', 'Chrysomyia thamnothini', 'et Tumrasvin, 1977', NULL, 'SPA_00738', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(737, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Calliphoridae', 'Nhặng', 'FAM_055', 'Chrysomyia', NULL, 'GEN_0405', 'chrysomyiavilleneuvi', 'Chrysomyia villeneuvi', 'Patton, 1922', NULL, 'SPA_00739', 'Phần trước ngực màu nâu, Mắt ở nam giới gần giống nhau, các mặt mắt nhỏ và đồng đều ở cả hai giới, phần mặt và hàm dưới có màu cam rực rỡ và sau này có lông vàng Ruồi ăn chất hữu cơ đang phân hủy, trong khi ấu trùng ruồi ăn mô sống của động vật có vú máu nóng, trái ngược với mô hoại tử mà nhiều ấu trùng calliphorid khác ăn.', NULL, ' châu Á, châu Phi, châu Đại Dương', NULL, NULL, NULL, NULL, NULL, NULL, 'indiabiodiversity.org'),
(738, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Calliphoridae', 'Nhặng', 'FAM_055', 'Cosmina', NULL, 'GEN_0473', 'cosminabicolor', 'Cosmina bicolor', '(Walker 1856)', NULL, 'SPA_00740', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(739, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Calliphoridae', 'Nhặng', 'FAM_055', 'Hemipyrellia', NULL, 'GEN_0858', 'hemipyrellialigurriens', 'Hemipyrellia ligurriens', '(Wiedemann, 1830)', NULL, 'SPA_00741', 'Độ lồi siêu xoắn được bao phủ bởi những sợi lông dài, dựng đứng, mịn. Đoạn anten thứ ba hoàn toàn hoặc phần lớn có màu nâu sẫm đến màu nâu sẫm; bụng màu xanh kim loại đến màu xanh lục, có lớp bụi trắng mỏng ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'indiabiodiversity.org'),
(740, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Calliphoridae', 'Nhặng', 'FAM_055', 'Hyppopygiopsis', NULL, 'GEN_0940', 'hyppopygiopsisinfumata', 'Hyppopygiopsis infumata', NULL, NULL, 'SPA_00742', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(741, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Calliphoridae', 'Nhặng', 'FAM_055', 'Hyppopygiopsis', NULL, 'GEN_0940', 'hyppopygiopsistumrasvini', 'Hyppopygiopsis tumrasvini', NULL, NULL, 'SPA_00743', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(742, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Calliphoridae', 'Nhặng', 'FAM_055', 'Isomyia', NULL, 'GEN_0977', 'isomyiaelecta', 'Isomyia electa', '(Villeneuve, 1927)', NULL, 'SPA_00744', 'Chiều dài cơ thể 12-15mm, ruồi lớn. Thân của gân cánh R có lông, có lông vũ và lông đơn, không giống lược kép (tộc Cosminini), vùng đầu sau phía trên để trần, có dải dưới mép bóng, mép dưới vùng mặt nhô ra giống như mũi Cấu trúc (Đặc điểm của phân họ Rhinomythinae). Mép trên của tấm trung mô và tấm bên có chùm lông. Cơ thể mập mạp, các vạt cơ bản của cánh dưới có hình thùy rõ ràng. Các phiến bên có lông mịn màu vàng, các phiến giữa và phiến bên có ít hoặc nhiều lông mịn màu đen. Có ba cặp tua trên sợi lanh nhỏ, cách đều nhau. Các lỗ thở giữa ngực có màu vàng vàng. Sinh thái chưa rõ, trưởng thành thường sống trong rừng, bụi rậm hoặc cỏ, thích đi thăm hoa và sống vào ban ngày, dễ thu hái vào ban ngày khi có nắng gắt. Có thể là loài ký sinh hoặc săn mồi.', NULL, ' Nam và Tây Nam Trung Quốc, Đài Loan, Okinawa, Nhật Bản, Myanmar, Malaysia, Nam Á.', NULL, NULL, NULL, NULL, NULL, NULL, 'taieol.tw'),
(743, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Calliphoridae', 'Nhặng', 'FAM_055', 'Isomyia', NULL, 'GEN_0977', 'isomyiafacialis', 'Isomyia facialis', NULL, NULL, 'SPA_00745', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(744, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Calliphoridae', 'Nhặng', 'FAM_055', 'Isomyia', NULL, 'GEN_0977', 'isomyiaisomyia', 'Isomyia isomyia', NULL, NULL, 'SPA_00746', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(745, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Calliphoridae', 'Nhặng', 'FAM_055', 'Isomyia', NULL, 'GEN_0977', 'isomyiaviridana', 'Isomyia viridana', '(Townsend, 1917)', NULL, 'SPA_00747', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(746, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Calliphoridae', 'Nhặng', 'FAM_055', 'Lucilia', NULL, 'GEN_1116', 'luciliabazini', 'Lucilia bazini', 'Seguy, 1934.', NULL, 'SPA_00748', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(747, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Calliphoridae', 'Nhặng', 'FAM_055', 'Lucilia', NULL, 'GEN_1116', 'luciliahainanensis', 'Lucilia hainanensis', 'Fan, 1965', NULL, 'SPA_00749', 'Với chiều dài cơ thể 8,5-11 mm, nó là loài tương đối lớn trong chi Greenfly. Màu sắc cơ thể là màu xanh lá cây với ánh kim loại. Côn trùng đực và cái có thể được phân biệt bằng hình dạng đầu của mắt kép. Mắt kép đực có diện tích rộng và có kiểu mắt nhắm, trong khi mắt kép cái có diện tích hẹp, diện tích phía trước rộng và có mí mắt khép kín. mẫu mắt. Thân của gân cánh R để trần và không có lông. 3-4 cặp lông cứng ở đường khâu sau. Các vảy cơ bản ở mép trước có màu nâu và đen. Độ lồi lồi lõm trần hoặc chỉ có nhung mao. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'taieol.tw'),
(748, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Calliphoridae', 'Nhặng', 'FAM_055', 'Lucilia', NULL, 'GEN_1116', 'luciliaporphyrina', 'Lucilia porhyrina', '(Walker, 1856)', NULL, 'SPA_00750', 'Với chiều dài cơ thể 8,5-11 mm, nó là loài tương đối lớn trong chi Greenfly. Màu sắc cơ thể là màu xanh lá cây với ánh kim loại. Côn trùng đực và cái có thể được phân biệt bằng hình dạng đầu của mắt kép. Mắt kép đực có diện tích rộng và có kiểu mắt nhắm. Ruồi sinh sản trong xác các loài chim và động vật đẻ trứng thành từng đám gần gốc lông hoặc lông, ở mặt dưới cơ thể. Có thể tìm thấy tới mười con cái đang đẻ trứng cùng nhau', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'indiabiodiversity.org'),
(749, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Calliphoridae', 'Nhặng', 'FAM_055', 'Stomorhina', NULL, 'GEN_1867', 'stomorhinadiscolor', 'Stomorhina discolor', '(Fabricius, 1794)', NULL, 'SPA_00751', 'Bụng có màu vàng, mép sau đốt bụng thứ nhất và thứ hai có sọc đen; râu màu nâu, có bụi dày màu xám, đốt thứ hai màu đỏ; coxae của chân trước màu vàng ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'indiabiodiversity.org'),
