(757, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Culicidae', 'Muỗi', 'FAM_109', 'Anopheles', NULL, 'GEN_0105', 'anophelessinensis', 'Anopheles sinensis', 'Wiedemann, 1828', NULL, 'SPA_00759', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(758, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Culicidae', 'Muỗi', 'FAM_109', 'Culex', NULL, 'GEN_0503', 'culexfuscanus', 'Culex fuscanus', 'Wiedemann, 1820', NULL, 'SPA_00760', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(759, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Culicidae', 'Muỗi', 'FAM_109', 'Culex', NULL, 'GEN_0503', 'culexquinquefasciatus', 'Culex quinquefasciatus', 'Say, 1823', NULL, 'SPA_00761', ' là loài muỗi cỡ trung bình và có màu nâu. Cơ thể dài khoảng 3,96 đến 4,25 mm. Trong khi cơ thể chính có màu nâu thì vòi , ngực , cánh và cổ chân có màu sẫm hơn phần còn lại của cơ thể. Đầu có màu nâu nhạt, phần sáng nhất ở giữa. Các râu và vòi có chiều dài bằng nhau, nhưng trong một số trường hợp, râu ngắn hơn một chút so với vòi. Roi có 13 đốt , có thể có ít hoặc không có vảy . Các vảy của ngực hẹp và cong. Bụng có các dải tròn, hẹp, nhợt nhạt ở mặt đáy của mỗi đốt . Con đực có thể được phân biệt với con cái ở chỗ có lòng bàn tay lớn và râu có lông. \n\nẤu trùng có đầu ngắn và mập mạp. Bàn chải miệng có những sợi dài màu vàng dùng để lọc chất hữu cơ. Bụng bao gồm tám đoạn, ống hút và yên ngựa . Mỗi phân đoạn có một mẫu setae duy nhất . Ống hút nằm ở mặt lưng của bụng và dài gấp bốn lần chiều rộng của nó. Xi phông có nhiều búi lông cứng. Yên ngựa có hình thùng và nằm ở phía bụng bụng, có bốn nhú hậu môn dài nhô ra từ đầu sau.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia.'),
