(819, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'DIPTERA', 'HAI CÁNH', 'ORD_033', 'Sarcophagidae', 'Ruồi Xám', 'FAM_326', 'Boettcherisca', NULL, 'GEN_0231', 'boettcheriscaperegrina', 'Boettcherisca peregrina', '(Robineau-Desvoidy, 1830)', NULL, 'SPA_00822', 'Sarcophaga peregrina trông giống ruồi bình thường và thường khó nhận biết một cách dễ dàng. Chiều dài cơ thể trung bình là 8–11 mm. Màu cơ thể là màu xám với các mảng màu đen. Phần dưới của đầu có màu xám bạc. Ngực có màu xám hoàn toàn với ba sọc đen đặc trưng, ​​​​được đánh dấu dọc theo trục dọc của cơ thể. Bụng cũng có màu xám sọc đen; một đường dọc ở giữa và ba đường ngang lớn. Sọc bụng đầu tiên có hình chữ V. Đôi cánh trong suốt. ', NULL, '  khu vực Đông Nam Á từ Sri Lanka đến Indonesia , Trung Quốc , Nhật Bản , Úc , Samoa và Quần đảo Cook , Hawaii và khắp châu Âu .', NULL, NULL, NULL, NULL, NULL, NULL, 'en.wikipedia.org'),
