(848, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HEMIPTERA', 'CÁNH NỬA', 'ORD_040', 'Belostomatidae', 'Chân Bơi', 'FAM_042', 'Lethocerus', NULL, 'GEN_1071', 'lethocerusindicus', 'Lethocerus indicus', 'Lep. et Serv.', 'Cà cuống', 'SPA_00851', 'Cơ thể hình lá, dẹp, mỏng, Đầu pronotum và scutellum màu vàng nhạt đến nâu sẫm. Pronotum có viền mép trước và bên, và một số vệt hình đĩa màu vàng đến nâu nhạt. Scutellum có mảng nhạt ở hai góc đáy, có đường giữa hẹp và vùng đỉnh đen nâu. Mặt bụng sỉn, sternum có đường viền mép đồng màu. Các nốt đùi có nhiều vệt nâu đen, Đầu nằm giữa hai mắt, giới hạn bởi hai cạnh bên gần như song song, để phân biệt với loài Lethocerus deyrolley có đầu hình tam giác rõ rệt. Kích thước khoảng 70 - 80mm x 20 - 25mm Cà cuống là loài ăn thịt, hút dịch và máu của nhiều loài động vật thủy sinh, sâu bọ, cánh cứng, tôm, ốc, nhái và cá nhỏ.... Sinh sản vào các tháng 5 - 8 dương lịch, đẻ thành túi bao quanh thân lúa hoặc cỏ, mằn sát trên mặt nước. Búi trứng hình trụ, cỡ khoảng 25 - 30mm x 10mm. Màu vàng đến trắng nhờ có vài chục đến hàng trăm trứng. Trứng hình bầu dục cỡ khoảng 3,5mm. Thời gian phát triển của trứng khoảng 10 ngày, từ khi nở đến trưởng thành là 40 ngày. Cà cuống thuộc nhóm Bọ xít nước phát triển qua biến thái không hoàn toàn. Cà cuống sống ở các ao hồ, thủy vực và ruộng nước sâu, cây cỏ hay lúa mọc lúp xúp, ở điều kiện thí nghiệm có khi cả ngày mằm lờ đờ sát mặt nước, chìa ống thở lên trên. Tuy bay không khỏe, nhưng Cà cuống hay bay lên bờ hoặc từ vực thủy này sang thủy vực khác, nhất là khi chuẩn bị đẻ trứng. Cà cuống rất nhạy cảm với kích thích của ánh sáng, ban đêm thường bay đến những nơi có đèn điện sáng. Con đực thường ẩn nấp quanh các ổ trứng, để thỉnh thoảng quạt khí cho trứng. Trên mình Cà cuống hay gặp một số Ve nước Hydrachinidae ký sinh. Muỗi năn thuộc họ Cecidomyidae cũng tấn công trứng của Cà cuống', NULL, 'Ở khắp vùng đồng bằng trên lãnh thổ Việt Nam Miền Viễn đông liên bang Nga, và vùng nhiệt đới; từ Ấn Độ qua Trung Quốc đến Australia', NULL, NULL, 'Đây là loài ăn thịt rất khỏe nên đáng chú ý trong chu trình dinh dưỡng ở một số thủy vực, đặc biệt là ở những nơi ươm cá giống. Từ thời Triệu Đà (207 đến 137 trước công nguyên) Cà cuống đã được xếp trong những sơn hào, hải vị của người Việt, để cống sang Trung Quốc với cái tên là con Sâu quế. Tuyến thơm của Cà cuống đực, thịt và trứng của con cái là món gia vị rất độc đáo ưa chuộng của người Việt Nam, Lào, Trung Quốc và nhiều nước trong vùng', 'VU A1 c,d,e C2b,c,e', NULL, NULL, 'VN Creature'),
