(854, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Coreidae', 'Bọ Xít Mép', 'FAM_102', 'Anteromorpha', NULL, 'GEN_0113', 'anteromorphacuberata', 'Anteromorpha cuberata', '            ', 'Bọ xít đỏ', 'SPA_00857', 'Dài thân từ 9 - 16mm, đầu có màu cam. Vòi, rảnh ngang trước và gở trên tám lưng ngực trước, mặt dưới thân màu đỏ tươi. Râu đầu, râu đầu của vòi, tấm mai lưng (đôi khi tấm mai lưng cùng màu với thân) một điểm tròn lớn trên tấm cứng của cánh trước, cánh màng và chân có màu đen. Gờ cổ trên tấm lưng ngực trước, gờ trước tấm bụng ngực trước, gờ sau tấm bụng ngực sau, gờ đốt bụng và đốt gốc chân có màu kem trắng Bọ xít trưởng thành và nhộng của chúng đều ăn chồi hoa và các quả bông vải còn non hay đã mở một phần. Chúng đục xuyên qua các xơ và ăn các hạt bông vải trong quả. Các mô bị tổn thương bị các vi sinh vật xâm thực, khiến quả thối rữa và biến màu. Quả bị nhiễm bọ xít thường phát triển không đầy đủ, mở và rụng sớm. Các triệu chứng sau đó là hạt nhỏ. lượng dầu ít và có tỷ lệ nẫy mầm thấp. Các hạt như thể không thích hợp để gieo trồng. Chúng thường ăn từ cây này chuyển sang các quả non ở cây khác', NULL, 'Loài này phân bố khắp các khu vực có trồng cây bông vải ở Việt Nam ', NULL, NULL, 'Có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
