(865, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Coreidae', 'Bọ Xít Mép', 'FAM_102', 'Dalader', NULL, 'GEN_0542', 'daladerdistanti', 'Dalader distanti', 'Blúte, 1902', '', 'SPA_00868', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(866, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Coreidae', 'Bọ Xít Mép', 'FAM_102', 'Dalader', NULL, 'GEN_0542', 'daladerplaniventris', 'Dalader planiventris', '(Westwood, 1842)', NULL, 'SPA_00869', 'Bọ lớn chủ yếu màu nâu, hình dáng kỳ dị do liên kết cực giãn, một đặc điểm khác biệt của loài bọ này là đoạn anten thứ ba giãn ra, màu từ nâu đến nâu đỏ ở mặt lưng và bụng hơi sẫm hơn, chân có màu đỏ rõ rệt, râu màu đen đỏ. Đầu: đầu dài hơn rộng một chút, hai bên song song, ngoại trừ mắt nhỏ hình cầu, phần trước hơi cúi xuống, các củ râu màu nổi rõ, các mắt hơi gần mắt hơn nhau. Rostrum ngắn và đạt đến midcoxae. Ngực: phần đầu có hình dạng kỳ dị do vùng xương cánh tay mở rộng rõ rệt, vùng giữa các vùng này phẳng nhưng dốc về phía trước cũng như phía sau, bề mặt được bao phủ bởi lông cứng với gốc củ hành và lông cứng ngắn và một đường carinate nhạt ở giữa, rìa trước của nó rộng bằng đầu trong khi rộng nhất ở phần nhô ra của xương cánh tay, rìa sau của nó uốn lượn nhẹ nhàng trên vảy. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'indiabiodiversity.org'),
