(871, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Coreidae', 'Bọ Xít Mép', 'FAM_102', 'Homoeocerus', NULL, 'GEN_0898', 'homoeocerusgraminis', 'Homoeocerus graminis', '(Fabr.)', '', 'SPA_00874', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(872, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Coreidae', 'Bọ Xít Mép', 'FAM_102', 'Homoeocerus', NULL, 'GEN_0898', 'homoeocerusmarginellus', 'Homoeocerus marginellus', '(Herrich-Schaeffer, 1840).', NULL, 'SPA_00875', 'Chiều dài cơ thể 11,5-13 mm, chiều rộng bụng 4,5-4,8 mm. Thân màu vàng nâu, có chạm khắc tinh xảo. Có một đốm đen nhỏ ở giữa và giữa màng đệm, và một đốm nhỏ ở giữa da cánh trước, cả hai đều có màu đen. Các râu dài, đoạn thứ 2 bằng hoặc ngắn hơn một chút so với chiều rộng của pronotum, đoạn thứ 1 đến thứ 3 không hình lăng trụ, không có hạt màu đen, còn đoạn thứ 1 và thứ 4 có chiều dài bằng nhau. Cắn thẳng, gần chạm đến gốc của bàn chân giữa. Mép bên của pronotum có màu trắng vàng, hơi cong vào trong ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(873, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Coreidae', 'Bọ Xít Mép', 'FAM_102', 'Homoeocerus', NULL, 'GEN_0898', 'homoeocerusmenicus', 'Homoeocerus menicus', 'Hsiao, 1962.', NULL, 'SPA_00876', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(874, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Coreidae', 'Bọ Xít Mép', 'FAM_102', 'Homoeocerus', NULL, 'GEN_0898', 'homoeocerussimiolus', 'Homoeocerus simiolus', 'Dist.', NULL, 'SPA_00877', 'Chiều dài cơ thể 16-18 mm, màu nâu vàng. Ăng-ten màu đen ở gốc của phân đoạn thứ nhất và thứ hai, màu đen ở đầu của phân đoạn thứ hai và thứ ba và ở giữa của phân đoạn thứ tư. Beak đoạn 2 ngắn hơn đoạn 3, đoạn 3 bằng đoạn 4. Đường viền bên của prothorax có màu đen, và mesothorax và metathorax có một đốm đen ở mỗi bên. Mép ngoài của miếng da cánh trước có màu vàng nhạt, không có mép màu đen. Các đốm đen khắp cơ thể. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(875, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Coreidae', 'Bọ Xít Mép', 'FAM_102', 'Homoeocerus', NULL, 'GEN_0898', 'homoeocerussingalensis', 'Homoeocerus singalensis', 'Stal, 1873.', '', 'SPA_00878', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
