(882, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Coreidae', 'Bọ Xít Mép', 'FAM_102', 'Leptocorisa', NULL, 'GEN_1056', 'leptocorisaacuta', 'Leptocorisa acuta', '(Thunberg, 1783)', 'Bọ xít hôi hại lúa', 'SPA_00885', 'Thành trùng có màu xanh hơi pha nâu ở trên lưng và màu vàng nâu ở mặt bụng, dài từ 14-18 mm, mình thon dài, chân và râu đầu rất dài, râu đầu có 4 đốt. Đầu dài, 2 phiến cạnh của đầu nhô ra trước như dạng ngón tay. Bọ xít đực và cái phân biệt dễ dàng nhờ con cái ở cuối đốt bụng thứ 8 (thấy thực tế là đốt bụng thứ bảy) chẻ đôi thành 2 phần, trong khi ở con đực thì cuối bụng tròn.  Đời sống của thành trùng có thể đến 2-3 tháng, trong thời gian này một thành trùng cái có khả năng đẻ từ 250-300 trứng trong vòng khoảng 8 tuần. Trứng được đẻ thành nhiều hàng trên phiến lá, ở cả hai mặt, hoặc bẹ lá, mỗi ổ có từ 10-30 trứng.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'tiennong.com.vn'),
