(919, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Lygaeidae', 'Bọ Hạt', 'FAM_226', 'Graptostethus', NULL, 'GEN_0794', 'graptostethusservus', 'Graptostethus servus', 'Fabricius, 1787', NULL, 'SPA_00923', 'Con bọ nhỏ màu đỏ có hoa văn màu đen, râu và chân cũng màu đen, xương ức ngực màu đỏ có đốm đen, xương ức bụng màu xám nhạt, râu và mõm đen. Đầu: đầu hình tam giác, rộng bằng chiều dài, thùy giữa màu đen và nổi bật, dài hơn hơn thùy bên, có màu đỏ rõ rệt. Ăng-ten bốn múi, đoạn đầu tiên vượt quá đỉnh, đoạn thứ hai dài nhất, mắt to, hình cầu và màu đen, các mắt gần mắt nhau hơn nhiều, đỉnh ở giữa các mắt có màu đen với một đốm tròn nhỏ màu kem nhạt. Ngực: trước ngực hình tứ giác, rộng ở gốc hẹp dần về phía trước, mép trước lõm, phần còn lại của mép thẳng, các góc bên tròn, một mảng đen nằm ngang có rãnh hình sin sâu ở hai bên, phía sau mảng này có hai đốm tròn, mỗi bên một đốm tròn. phía bên của đường giữa, còn lại toàn bộ viền sau ngoại trừ một vùng nhỏ ở giữa, màu đen, toàn bộ bề mặt, đặc biệt là phần màu đỏ bị thủng sâu và lụi tàn, các vết thủng thành mảng đen thưa thớt hoặc không có. Scutellum đen, xương đòn và corium nửa đỏ nửa đen, toàn bộ phủ lông tơ màu xám, màng màu nâu sẫm có gân dọc thẳng. Xương ức-prosternum ngực phần lớn có màu đỏ, bị thủng, có một mảng đen nằm ngang ngay trước phần trước xương ức. Mesosternum phần lớn có màu đen. Metasternum cũng có màu đen ở phần trước và màu đỏ ở phần sau, rìa ngoài cùng có các đốm đen bóng hình bầu dục lớn, mỗi đốm trên pro meso meta xương ức. Bụng: Các xương ức ở bụng có màu nâu nhạt đến hơi đen.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'indiabiodiversity'),
(920, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Lygaeidae', 'Bọ Hạt', 'FAM_226', 'Lachnophorus', NULL, 'GEN_1011', 'lachnophorussingalensis', 'Lachnophorus singalensis', '(Dohrn, 1860)', NULL, 'SPA_00924', 'Màu sắc tổng thể là sự pha trộn giữa màu hơi nâu và hơi đen trên mặt lưng. Đầu và phần trước ngực chủ yếu có màu đen và có lông mu. Corium màu nâu nhạt và có vết thủng màu đen ở nửa gần, màu nâu sẫm đến đen ở nửa sau với một dải ngang màu trắng ở giữa. Màng một phần sẫm màu một phần khói với một đốm trắng ở đầu. Bụng có màu đen. Đầu hình tam giác, hơi cong xuống, rộng bằng mép trước của đại từ, mắt sát mép đại từ; râu dày, đoạn đầu dài quá đỉnh đầu; rostrum dài vừa phải, đạt tới midcoxae. Ngực: phần trước rộng ở góc xương cánh tay và chỉ hơi thu hẹp về phía trước, các cạnh của nó dát mỏng. Đĩa lồi có lỗ thủng mịn và có tuổi dậy thì dài. Scutellum traningular bị thủng chặt và có lông mu. Xương đòn có màu nhạt hơn vảy. Hemelytra phát triển tốt, corium thủng thô như xương đòn. Màng có các đường gân rõ ràng. Chân dài vừa phải, xương đùi sẫm màu hơn, xương chày và cổ chân hơi nhợt nhạt, có lông mu. Xương đùi trước sưng lên và có gai nổi rõ bên dưới. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'indiabiodiversity.org'),
