(940, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Pentatomidae', 'Bọ Xít', 'FAM_279', 'Chlorochroa', NULL, 'GEN_0388', 'chlorochroasp1', 'Chlorochroa sp.1', NULL, NULL, 'SPA_00944', ' trưởng thành có kích thước dài từ 8-19 mm và có hình bầu dục rộng. [2] Chúng có màu từ xanh đến nâu hoặc gần như đen và có viền màu đỏ nhạt/vàng/trắng xung quanh cơ thể ngoại trừ đầu. [2] [4] Đối với ít nhất một số loài, màu sắc thay đổi theo vĩ độ, đậm hơn ở phía nam và xanh hơn ở phía bắc. [2] Phần vảy dài và có hình tam giác, đôi khi có ba vết lồi ở gốc và thường phần đầu có màu nhạt hơn phần còn lại. [2] [4] Màng cánh trước thường trong mờ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Chlorochroa'),
