(944, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Pentatomidae', 'Bọ Xít', 'FAM_279', 'Dalpada', NULL, 'GEN_0543', 'dalpadaoculata', 'Dalpada oculata', '(Fabricius 1775)', NULL, 'SPA_00948', 'Màu cơ thể của nó là màu đất son nhạt, đầu màu xanh lá cây đậm, râu màu đen và trên lưng phân bố đều đặn các hoa văn màu trắng sữa. Có những đốm tròn và những đốm tận cùng ở hai góc đáy của lớp màng cứng. Nếu bỏ qua các xúc tu, kỳ đà giống như một con rùa thu nhỏ ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(945, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Pentatomidae', 'Bọ Xít', 'FAM_279', 'Dalsira', NULL, 'GEN_0544', 'dalsiraglandulosa', 'Dalsira glandulosa', '(Poir.) Bornm.', NULL, 'SPA_00949', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(946, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Pentatomidae', 'Bọ Xít', 'FAM_279', 'Dolycoris', NULL, 'GEN_0601', 'dolycorisbaccarum', 'Dolycoris baccarum', '(Linnaeus, 1758)', NULL, 'SPA_00950', 'chiều dài khoảng 10–12,5 mm (0,39–0,49 in). Màu sắc cơ bản của pronotum và elytra khá thay đổi, nhưng thông thường nó có màu tím đỏ, trong khi scutellum có màu đất son. Vào mùa đông, màu cơ bản là màu nâu xỉn. Toàn thân có khá nhiều lông. Các râu được tạo thành từ 4-5 phần màu đen và trắng, mép bụng (connexivum) xen kẽ các đốm màu trắng và đen. Nam và nữ rất giống nhau.  ', NULL, ' Châu Âu và Trung Á. ', NULL, NULL, NULL, NULL, NULL, NULL, 'en.wikipedia.org'),
