(968, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Pentatomidae', 'Bọ Xít', 'FAM_279', 'Rhynchocoris', NULL, 'GEN_1747', 'rhynchocorishumeralis', 'Rhynchocoris humeralis', 'Thunberg.', NULL, 'SPA_00972', 'Trưởng thành:\n– Có hình ngũ quan màu xanh lá cây, bóng và dài 21 – 23 mm, có hai gai nhọn ở phía trước hai bên ngực, hau bên mép bụng có rìa hình răng cưa, vời chích hú dài đến cuối bụng.\nTrứng:\n– Hình tròn, đường kính 1mm, lúc mới đẻ có màu trắng trong, xanh lam, sau đó chuyển sàn màu trắng đục, sắp nở có màu nâu sẫm hơn mặt trứng có nhiều chấm lõm.\n– Hình tròn, đường kính 1mm, lúc mới đẻ có màu trắng trong, xanh lam, sau đó chuyển sàn màu trắng đục, sắp nở có màu nâu sẫm hơn mặt trứng có nhiều chấm lõm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'nhatnonggroup'),
