(974, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Pentatomidae', 'Bọ Xít', 'FAM_279', 'Tessaratoma', NULL, 'GEN_1935', 'tessaratomajavanica', 'Tessaratoma javanica', '(Thunberg, 1783)', NULL, 'SPA_00978', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(975, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Pentatomidae', 'Bọ Xít', 'FAM_279', 'Tessaratoma', NULL, 'GEN_1935', 'tessaratomapapillosa', 'Tessaratoma papillosa', '(Drury, 1770) ', NULL, 'SPA_00979', 'Trưởng thành có màu vàng nâu, mặt bụng bao phủ một lớp sáp màu trắng chiều dài thân 25–30 mm. có hình 5 cạnh, cánh trước là loại cánh nửa cứng. Trứng mới đẻ có dạng gần tròn, đường kính khoảng 2 mm, màu xanh nhạt hoặc vàng. Sau đó từ từ trở nên màu vàng nâu. Khi sắp nở, trứng có màu xám đen. Bọ xít non gồm 5 tuổi. Tuổi 1 dài khoảng 5 mm, tuổi 5 dài 18–20 mm. Trưởng thành có tính giả chết khi bị động mạnh hoặc khi trời nắng gắt thì rơi xuống đất sau khi hết động hoặc khi trời mát lại bò lên hại. Một đến hai ngày sau khi bắt cặp trưởng thành đẻ trứng ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'vi.wikipedia.org'),
