(982, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Pyrrhocoridae', 'Bọ Xít Đỏ', 'FAM_314', 'Dindymus', NULL, 'GEN_0584', 'dindymuscingulatus', 'Dindymus cingulatus', 'Fabr., 1775', '', 'SPA_00986', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(983, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Pyrrhocoridae', 'Bọ Xít Đỏ', 'FAM_314', 'Dindymus', NULL, 'GEN_0584', 'dindymusrubinosus', 'Dindymus rubiginosus', '(Fabricius, 1787)', NULL, 'SPA_00987', 'Cơ thể trưởng thành dài 15 mm, đầu, bầu ngực, tấm lưng, phần sau của đoạn bụng và cánh trước hầu như đều có màu đỏ đất, và mỏ cũng chủ yếu có màu đỏ. Có một đốm đen hình bầu dục lớn ở trung tâm da của cánh trước, râu màu đen với bốn đoạn và gốc của đoạn đầu tiên là màu đỏ son. Có các sọc trắng hình vòng cung ở bên ngoài mỗi phần chân đế và mỗi phần chân có màu đỏ và đen. Nhộng có màu vàng khi mới nở và đỏ sau nửa ngày. 2 Vết đen xuất hiện trên mặt sau của nhộng ong và các sọc trắng xuất hiện ở cả hai bên. Chồi cánh xuất hiện ở lần thứ 3, với 3 đốm nâu đỏ trên lưng và 3 đốm trắng ở mỗi bên. Con thứ 5 dài 8-10 mm, tương tự như con trưởng thành, với cổ màu trắng. Trứng hình bầu dục màu vàng, bề mặt nhẵn, dài 11 mm và rộng 0,8 mm ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(984, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Pyrrhocoridae', 'Bọ Xít Đỏ', 'FAM_314', 'Dysdereus', NULL, 'GEN_0621', 'dysdereuscingulatus', 'Dysdereus cingulatus', '(Fabricius, 1775)', NULL, 'SPA_00988', 'Dài thân từ 9 - 16mm, đầu có màu cam. Vòi, rảnh ngang trước và gở trên tám lưng ngực trước, mặt dưới thân màu đỏ tươi. Râu đầu, râu đầu của vòi, tấm mai lưng (đôi khi tấm mai lưng cùng màu với thân) một điểm tròn lớn trên tấm cứng của cánh trước, cánh màng và chân có màu đen. Gờ cổ trên tấm lưng ngực trước, gờ trước tấm bụng ngực trước, gờ sau tấm bụng ngực sau, gờ đốt bụng và đốt gốc chân có màu kem trắng', NULL, 'Loài này phân bố khắp các khu vực có trồng cây bông vải ở Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=6&loai=3&ID=8'),
