(1048, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Reduviidae', 'Bọ Sát Thủ', 'FAM_318', 'Scadra', NULL, 'GEN_1783', 'scadrarelata', 'Scadra relata', 'Distant, 1903', NULL, 'SPA_01052', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1049, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Reduviidae', 'Bọ Sát Thủ', 'FAM_318', 'Sirthenea', NULL, 'GEN_1831', 'sirtheneaflavipes', 'Sirthenea flavipes', '(Stal 1855)', NULL, 'SPA_01053', 'Rệp lớn thon dài, pronotum màu nâu đỏ, hemelytra màu vàng ở gốc và màu nâu sẫm ở phần còn lại, đầu màu nâu đỏ, tất cả các chân màu vàng nhạt, bên dưới đầu và xương ức màu nâu sẫm, bụng bên màu nâu sẫm nhưng màu nâu vàng nhạt trên đĩa. Đầu: đầu thon dài, gần bằng pronotum, vùng trước mắt dài hơn nhiều so với vùng sau mắt. Các củ có râu màu khác biệt và có thể nhìn thấy từ mặt lưng, các râu tương đối ngắn, đoạn đầu tiên không chạm đến đỉnh đầu, dày hơn và có màu nâu nhạt, đoạn thứ hai hơi sẫm hơn và rậm rạp và dày vừa phải, các đoạn còn lại mỏng, toàn bộ râu cụt. Đôi mắt to và hình cầu, Ocelli nổi bật, nằm ở vùng hơi cao phía sau mắt và gần hai mắt hơn nhau. Toàn bộ mặt lưng trước mắt phẳng, đầu phía dưới nhẵn bóng, màu nâu nhạt. Rostrum khỏe mạnh, nằm trên một mỏm tuyến tiền liệt giống như cột sống kéo dài ra ngoài coxae. Ngực: Pronotum gần như vuông, một rãnh ngang sâu ở 1/3 sau ngăn cách thùy trước và thùy sau, thùy sau nhẵn, lõm vào đĩa hơn các góc, thùy trước tròn hai bên màu nâu đỏ sáng ở mặt lưng với rãnh dọc nổi rõ và một một số lông tơ dài rải rác, mép trước lõm xuống phía sau cổ, các góc trước gần như tròn, các góc xương cánh tròn, mép sau hơi nhô ra trên vảy. Scutellum màu đen và hình tam giác với một lớp lông cứng dày đặc dọc theo gốc. Hemelytra tập trung dày đặc trên corium, corium với hơn nửa phần gốc màu nâu vàng nhạt trong khi phần còn lại có màu nâu sẫm, màng màu nâu xám sẫm, kéo dài gần đến đầu bụng, để lộ một vùng nhỏ. Phần trước xương ức màu nâu nhạt với mỏm xương ức dài kéo dài đến 1/3 mạc treo xương ức, phần giữa và xương ức màu đen và được bao phủ bởi lông tơ dài màu vàng, mạc treo có carina nổi rõ ở giữa, xương ức nổi lên ở hai bên, hơi nhô ra giữa xương ức. metacoxae. Tất cả các chân có màu nâu vàng nhạt, xương đùi trước và xương đùi sưng lên, xương chày trước có lớp đệm xốp nổi bật chiếm gần một nửa chiều dài. Bụng: hơi dẹt sang một bên, các vùng bên màu nâu sẫm và se lại, vùng đĩa giữa màu nâu nhạt. Connexivum nổi bật với các mảng màu kem nhạt, màu nâu sẫm và nâu nhạt, các lỗ thở nằm rất gần mép ngoài hơn là mép trước.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'indiabiodiversity'),
(1050, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Reduviidae', 'Bọ Sát Thủ', 'FAM_318', 'Sphedanolestes', NULL, 'GEN_1841', 'sphedanolestesmendicus', 'Sphedanolestes mendicus', 'Stal', '', 'SPA_01054', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1051, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Reduviidae', 'Bọ Sát Thủ', 'FAM_318', 'Sycanus', NULL, 'GEN_1886', 'sycanusbifidus', 'Sycanus bifidus', 'Fabr.', NULL, 'SPA_01055', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1052, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HETEROPTERA', 'CÁNH KHÁC', 'ORD_041', 'Reduviidae', 'Bọ Sát Thủ', 'FAM_318', 'Sycanus', NULL, 'GEN_1886', 'sycanuscroceovittatus', 'Sycanus croceovittatus', 'Dohrn.', NULL, 'SPA_01056', 'Con cái dài 23-26mm, con đực dài 19-21mm. Cơ thể màu đen, và nửa miếng da ở cánh trước có màu vàng và vàng rơm. Đầu mảnh mai, là tổng thể của prothorax và màng cứng nhỏ. Vùng sau dài hơn vùng trước. Râu mảnh, màu đen đặc, có 4 đoạn, đoạn đầu dài bằng hai chân trước. Đoạn cơ bản dài hơn đoạn trước của đầu, ngắn hơn đoạn thứ hai và phần cuối có màu hạt dẻ. Các gai nhỏ dài hơn, hai đầu phân nhánh, bán cương cứng. Thùy sau của tuyến trước dài hơn thùy trước, góc bên nhỏ có những chỗ lồi nhỏ, đáy thùy trước hẹp hơn thùy sau, thùy sau có nếp nhăn vỏ cam . Hình ảnh bên được mở rộng rất nhiều, phân đoạn thứ ba và thứ tư đặc biệt rộng, phân đoạn thứ hai và thứ ba hơi nhọn về phía sau, và các đường khâu bên dưới phân đoạn thứ hai đến thứ năm được nâng lên và có gờ. Khí khổng ở hạ vị có màu vàng nâu nhạt, bên trong có một lớp lông tơ tròn màu trắng. Chân có lông. Trứng: hình trụ dài. Màu nâu, đỏ nhạt lúc mới đẻ, nâu đỏ trước khi nở. Nhộng: Khi mới nở có màu đỏ cam nhạt, chuyển dần sang màu hồng và cuối cùng là màu nâu đỏ. Mặt sau bụng có 3 chỗ lồi giống khối u màu đen. Chân xám đen. Có đốm đen ở cả hai bên và trung tâm của lễ hội mùa đông bụng. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
