(1071, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cercopidae', 'Ve Sầu Bọt', 'FAM_067', 'Callitettix', NULL, 'GEN_0288', 'callitettixversicolor', 'Callitettix versicolor', '(Fabricius, 1794)', NULL, 'SPA_01075', 'Chiều dài thân 11 ~ 13,5mm. Toàn bộ màu đen bóng, dài và hẹp, các cạnh gần song song. Các cánh trước có màu đen tuyền, với hai đốm trắng lớn ở gần gốc và một đốm đỏ hình quả thận (con đực) hoặc hai đốm đỏ lớn và nhỏ (con cái) ở gần cuối. Bàn chân và bụng màu đen, bàn chân dài, đặc biệt là cánh trước dài ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(1072, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cercopidae', 'Ve Sầu Bọt', 'FAM_067', 'Cosmoscarta', NULL, 'GEN_0477', 'cosmoscartabispecularis', 'Cosmoscarta bispecularis', '(White, 1844).', NULL, 'SPA_01076', 'Chiều dài từ đầu đến cuối cánh là 13-15mm. Màu cơ thể là màu đỏ; ngực và cánh có các đốm đen và nhỏ, một số cá thể có hai đốm đen trên lớp đệm và lưng hợp nhất thành một mảng lớn. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(1073, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cercopidae', 'Ve Sầu Bọt', 'FAM_067', 'Cosmoscarta', NULL, 'GEN_0477', 'cosmoscartadorsimacula', 'Cosmoscarta dorsimacula', '(Walker, 1851)', NULL, 'SPA_01077', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1074, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cercopidae', 'Ve Sầu Bọt', 'FAM_067', 'Cosmoscarta', NULL, 'GEN_0477', 'cosmoscartaegens', 'Cosmoscarta egens', '(Walker, 1858)', NULL, 'SPA_01078', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1075, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cercopidae', 'Ve Sầu Bọt', 'FAM_067', 'Cosmoscarta', NULL, 'GEN_0477', 'cosmoscartafictilis', 'Cosmoscarta fictilis', '(Butler, 1874).', NULL, 'SPA_01079', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1076, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cercopidae', 'Ve Sầu Bọt', 'FAM_067', 'Cosmoscarta', NULL, 'GEN_0477', 'cosmoscartaheroina', 'Cosmoscarta heroina', 'Distant, 1908', NULL, 'SPA_01080', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1077, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cercopidae', 'Ve Sầu Bọt', 'FAM_067', 'Cosmoscarta', NULL, 'GEN_0477', 'cosmoscartaheros', 'Cosmoscarta heros', '(Fabricius, 1803)', NULL, 'SPA_01081', 'Chiều dài cơ thể của con đực là 14,6-17,0mm, của con cái là 15,6-17,2mm. Đầu (kể cả mặt) và pronotum có màu đen tím bóng. Mắt kép màu xám, mắt đơn màu vàng nhạt. Phần đế ăng-ten màu nâu, màu cam hoặc cam hoặc đỏ máu. Màng đệm có màu cam, các cánh trước màu đen, có một dải ngang màu vàng cam trước vùng vân lưới ở gốc cánh hoặc ở đầu cánh. Cánh sau màu trắng xám và trong suốt, gân lá màu nâu sẫm, gốc cánh và gân gốc cánh, vùng mép đầu và gốc 2/3 gân hướng tâm và vùng móng có màu đỏ nhạt. Bề mặt bụng của ngực có màu nâu hoặc tím đen, mảng bên của ngực và mạng lưới có màu cam hoặc đỏ cam hoặc đỏ như máu, các đốt sống lưng, các móng vuốt, phần cuối của chân và xương chày của bàn chân trước và bàn chân giữa. , và phần cuối của xương chày của bàn chân sau có màu xanh lục sẫm, và phần sau của xương chày có màu xanh đậm. Các phần gai của các gai bên và các gai cuối của xương chày và các gai của các gai thứ 1 và 2 của bàn chân sau là đen. Các đoạn bụng có màu cam hoặc đỏ cam hoặc đỏ như máu, các phiến bên và trung tâm của mạng đôi khi có màu đen. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(1078, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cercopidae', 'Ve Sầu Bọt', 'FAM_067', 'Cosmoscarta', NULL, 'GEN_0477', 'cosmoscartanagasana', 'Cosmoscarta nagasana', 'Distant, 1900.', NULL, 'SPA_01082', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
