(1081, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cercopidae', 'Ve Sầu Bọt', 'FAM_067', 'Eoscarta', NULL, 'GEN_0655', 'eoscartaborealis', 'Eoscarta borealis', 'Distant, 1878.', NULL, 'SPA_01085', 'chiều dài cơ thể khoảng 5 - 7mm, phần trên đầu có màu vàng nâu, cánh và thân màu đỏ ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(1082, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cercopidae', 'Ve Sầu Bọt', 'FAM_067', 'Eoscarta', NULL, 'GEN_0655', 'eoscartasemirosea', 'Eoscarta semirosea', 'Walker, 1857.', NULL, 'SPA_01086', 'Các râu ngắn và có nhiều lông, nằm ở phía trước của mắt kép; l 2 mỗi mắt, nằm trên đỉnh đầu; l Pronotum lớn, phẳng hoặc nổi lên rõ rệt; - Lớp bìu dài hơn hoặc bằng lớp tiền nhân; l Xương chày sau có 1-2 gai bên, cuối có 1-2 vòng gai tận cùng; l Đặt tên vì nhộng thường bị vùi trong bọt; l Bọt được tạo thành do trộn không khí khi chất nhầy do các tuyến biểu bì của đoạn bụng thứ 7 đến thứ 8 tiết ra từ hậu môn; ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
