(1102, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cicadellidae', 'Rầy Xanh', 'FAM_083', 'Tettigoniella', NULL, 'GEN_1945', 'tettigoniellaferruginae', 'Tettigoniella ferruginae', '(Fabricius, 1787)', NULL, 'SPA_01106', 'hân có cánh dài khoảng 13mm, màu vàng cam. Đầu, lớp đệm và lớp màng cứng nhỏ có màu vàng cam. Có một đốm đen hình tròn ở trung tâm của vương miện gần mép sau, và một đốm đen khác ở trên cùng, kéo dài hơi hình chữ nhật xuống mặt dưới; một đốm đen kéo dài giao nhau giữa nền môi trước và môi sau của khuôn mặt; mắt đơn và mắt kép có màu đen. Có ba điểm vàng trên lớp đệm, phân bố ở trung tâm gần mép trước và hai bên mép sau, thành phẩm sắp xếp theo hình ngoằn ngoèo, cũng có một điểm đen ở trung tâm của lớp bì. Cánh trước có màu vàng cam và hơi nâu, với một đốm đen nhỏ ở gốc cánh và đầu cánh màu đen; cánh sau màu đen. Ngực, bề mặt bụng và mặt sau của bụng đều màu đen, chỉ có mép bên của lưới ngực và mép sau của mỗi đoạn bụng có màu trắng vàng; bàn chân có màu trắng vàng, đoạn đáy. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
