(1107, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cicadidae', 'Ve Sầu', 'FAM_084', 'Cicadidae', NULL, 'GEN_0408', 'cicadidaesp1', 'Cicadidae sp.1', NULL, NULL, 'SPA_01111', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1108, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cicadidae', 'Ve Sầu', 'FAM_084', 'Cicadidae', NULL, 'GEN_0408', 'cicadidaesp2', 'Cicadidae sp.2', NULL, NULL, 'SPA_01112', 'Ve sầu là loài côn trùng lớn có đặc điểm là đôi cánh có màng, ba mắt hình tam giác trên đỉnh đầu và râu ngắn, giống như lông cứng.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Cicadidae'),
(1109, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cicadidae', 'Ve Sầu', 'FAM_084', 'Cryptotympana', NULL, 'GEN_0495', 'cryptotympanamandarina', 'Cryptotympana mandarina', 'Distant, 1891', 'Ve Sầu Trung Quốc ', 'SPA_01113', 'Cơ thể dài 40mm, sải cánh dài 115mm. Con đực có đầu phía trên màu đen. Mắt kép màu xám đen. Đốt bụng cuối có một đốm nhỏ nằm ở mỗi bên màu vàng đất. Thân dưới và chân màu đen. Một đốm ở mép trước của mặt, hai đốm ở mép giữa mặt và mắt kép, mép bên của mặt. Một đường sọc ở  đốt đùi, đốt ống chân sau (trừ gốc và ngọn). Mép của nắp che cơ quan phát âm, mép bụng và ngón của đốt cuối cùng có mảng vùng vàng màu đất tối. Cánh trước và cánh sau trong suốt, gân cánh màu xám. Cánh trước có màng màu hạt dẻ, ô ở giữa gốc nàu đen, khoảng 1/3 cánh trước và vùng gần tới đỉnh có màu hạt dẻ nhạt. Cánh sau nửa gốc màu nhạt tối. Nắp che cơ quan phát âm kéo dài bằng ½ bụng. Ấu trùng sống ở dưới đất và ăn các lớp mùn thảm thực vật rừng nơi phân bố. Ở Tam Đảo loài này ấu trùng lột xác vào đầu mùa mưa hàng năm.', NULL, 'Tuyên Quang, Bắc Cạn, Phú Thọ, Vĩnh Phúc, Ninh Bình, Hà Tĩnh và Thừa Thiên Huế, Gia Lai.  ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1110, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cicadidae', 'Ve Sầu', 'FAM_084', 'Dundubia', NULL, 'GEN_0617', 'dundubiahainanensis', 'Dundubia hainanensis', 'Beuk, 1996', NULL, 'SPA_01114', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1111, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cicadidae', 'Ve Sầu', 'FAM_084', 'Dundubia', NULL, 'GEN_0617', 'dundubiasp1', 'Dundubia sp1', NULL, NULL, 'SPA_01115', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1112, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cicadidae', 'Ve Sầu', 'FAM_084', 'Gaeana', NULL, 'GEN_0726', 'gaeanamaculata', 'Gaeana maculata', '(Drury, 1773)', NULL, 'SPA_01116', 'Mặt trên: đầu đen. Mắt màu nâu vàng, tròn và hơi nhô ra khỏi đầu; giữa chúng là hai đốm nhỏ màu cam. Ăng-ten nhỏ và ngắn. Ngực màu đen, có bốn đốm màu cam liên tiếp, nằm ngang và phía sau là hai đốm khác. Bụng màu đen, bao gồm bảy vòng hoặc vòng, ngoài phần đuôi, phần cuối có viền màu cam. Hậu môn có màu cam và có lông để rụng trứng. Cánh màu đen, có đốm và có sọc màu cam; mặt trước có một hàng sọc dọc theo mép ngoài và năm đốm màu cam rõ rệt chạy ngang giữa, gần vai: mặt sau có một mảng lớn màu cam ở mép bụng và một đốm tròn nhỏ phía trên, với năm đốm nhỏ mờ hơn đặt dọc theo các cạnh bên ngoài.\nMặt dưới: đầu màu đen, có mỏ dài mảnh, kéo dài giữa hai chân đến bụng; hai đốm nhỏ màu cam nằm ngay dưới mắt. Ngực có một đốm màu cam ở mỗi bên. Chân và bụng màu đen; cái sau có sáu đốm màu cam, ba đốm ở mỗi bên. Cánh như ở mặt trên. Sải cánh 3¾ inch (95 mm). ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'en.wikipedia.org'),
(1113, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cicadidae', 'Ve Sầu', 'FAM_084', 'Huechys', NULL, 'GEN_0910', 'huechysbeata', 'Huechys beata', 'Huechys beata', NULL, 'SPA_01117', 'Chiều dài thân 24 ~ 26mm. Trên trán có một sọc lớn, ngực có hai sọc và bụng màu đỏ cam, các phần còn lại màu đen, cánh màu đen. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(1114, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Cicadidae', 'Ve Sầu', 'FAM_084', 'Huechys', NULL, 'GEN_0910', 'huechyssanguinea', 'Huechys sanguinea', '(De Geer, 1773).', 'Ve Sầu Cánh Đen ', 'SPA_01118', 'Cơ thể dài 45 – 45mm (con đực), sải cánh dài 122-127mm (con đực). Cơ thể nhìn từ mặt có lưng màu đen, đỉnh đầu có 2 đốm đỏ (con mới nở màu đỏ hoàn toàn và cách màu trắng trong suốt).  Mắt kép có 2 đốm nhỏ ở trên đỉnh màu vàng nhạt.Mảnh lưng ngực giữa có 2 đốm gần mấu lồi hình chữ x, có màu vàng nhạt.  Mép bên kia của mặt má có màu đỏ gạch.\n\nCơ thể nhìn từ mặt bụng có màu đen với các đường chạy dọc bụng màu đỏ gạch. Cánh trước màu đen với các ô màu xanh nhạt đến trắng sữa. Cánh sau có màu xanh nhạt đến trắng sữa ở phần gốc cánh. Chân màu đen với các nốt đùi có màu đỏ gạch Ấu trùng sống ở dưới đất và ăn các lớp mùn thảm thực vật rừng nơi phân bố. Ở Nam bộ ấu trùng loài này lột xác vào đầu mùa mưa hàng năm (núi Bà Đen, Tây Ninh).', NULL, 'Tuyên Quang, Bắc Cạn, Phú Thọ, Vĩnh Phúc, Ninh Bình, Hà Tĩnh và Thừa Thiên Huế, Đồng Nai. Loài này sống ở các độ cao thấp cho đến 1000m ở núi Bà Đen, Tây Ninh. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
