(1136, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Flatidae', 'Ve Sầu Bướm', 'FAM_149', 'Lawana', NULL, 'GEN_1037', 'lawanaimitata', 'Lawana imitata', '(Melichar, 1902)', NULL, 'SPA_01140', 'sâu trưởng thành Thân dài 19-21,3mm, màu xanh lục hoặc trắng vàng, phủ một lớp bột sáp trắng. Đầu nhọn, xúc tu giống như lông tơ, mắt kép tròn, màu nâu sẫm. Có 3 gờ dọc trên trung bì. Các cánh trước có hình dạng hơi hình tam giác, màu hồng xanh hoặc trắng vàng, màu sáp, với các đường gân hình mạng dày đặc, mép ngoài thẳng, và các góc có gai nhọn và nổi rõ. Phần giữa của tĩnh mạch cánh và tĩnh mạch mông có màu vàng, nhánh của phần giữa của tĩnh mạch mông tiết ra nhiều bột sáp, chất này tập trung ở một điểm nhỏ ở phía trước buồng cánh. Cánh sau màu trắng hoặc vàng nhạt, trong mờ. trứng Hình thuôn dài, màu trắng hơi vàng nhạt, bề mặt có lưới mịn. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
