(1147, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Fulgoridae', 'Ve Sầu Đầu Dài', 'FAM_153', 'Kalidasa', NULL, 'GEN_0988', 'kalidasanigromaculata', 'Kalidasa nigromaculata', '(Gray, 1832)', NULL, 'SPA_01151', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1148, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Fulgoridae', 'Ve Sầu Đầu Dài', 'FAM_153', 'Penthicodes', NULL, 'GEN_1500', 'penthicodessp', 'Penthicodes sp.', NULL, NULL, 'SPA_01152', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1149, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Fulgoridae', 'Ve Sầu Đầu Dài', 'FAM_153', 'Penthicodes', NULL, 'GEN_1500', 'penthicodesvariegata', 'Penthicodes variegata', '(Guérin-Méneville, 1829)', 'Ve Sầu Đa Hình Sắc ', 'SPA_01153', 'Loài ve sầu có kích thước trung bình, sải cánh dài 55-60mm. Đầu, màng lưng ngược trước và mảng lưng ngực giữa có màu nâu đen. Cánh trước có màu nâu rất nhạt với rất nhiều những đốm màu đen không đồng nhất được bố trí không đều. Cánh sau có vùng ngọn cánh màu đen, vùng gốc đến 1/3 cánh có màu đỏ máu nhạt, vùng gốc cánh màu nâu đỏ, vùng giữa cánh có màu vàng cam với 3 đốm nhỏ màu trắng và các đốm màu đen không đều nằm trên cả 2 vùng vàng và đỏ . Phần bụng phí trên sát với mảnh lưng ngực được bao phủ một lớp phấn màu trắng  bên trên là màu nâu đỏ đậm Ấu trùng sống ở dưới đất và ăn các lớp mùn thảm thực vật rừng nơi phân bố. Ở Nam bộ ấu trùng loài này lột xác vào đầu mùa mưa hàng năm.', NULL, 'Phú Thọ, Vĩnh Phúc (Tam Đảo), Ninh Bình  (Cúc Phương) và Đồng Nai. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1150, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Fulgoridae', 'Ve Sầu Đầu Dài', 'FAM_153', 'Pyrops', NULL, 'GEN_1700', 'pyropscandelaria', 'Pyrops candelaria', '(Linnaeus, 1758)', 'Ve Sầu Vòi Voi Đầu Đỏ ', 'SPA_01154', 'Sải cánh dài 67-75mm. Phần đầu (gồm cả phần kèo dài) có màu đỏ đất hơi nâu với nhiều những đốm nhỏ màu trắng không đều. Mảnh lưng ngực trước, mảnh lưng ngực giữa màu vàng đất, hơi nâu. Cánh trước phần từ gốc cánh đến 2/3 cánh có màu xanh lá cây đậm, phần còn lại có màu nâu nhạt, sát gốc cánh có vệt màu vàng đất, 2 vệt xiên chéo nhau cũng có màu vàng đất, 3 đốm xếp theo hàng nhưng xiên cùng màu vàng. 5 đốm chạy ngang cánh ở vùng  gần ngọn cánh màu vàng đất,phần mép ngoài màu trắng, các đốm ở vùng ngọn cánh nhỏ hơn và cũng có màu vàng đất. Cánh sau vùng ngọn cánh màu tím than, tất cả phần còn lại có màu vàng rực.\nChiều dài từ đỉnh đầu  đến mắt kép là 16-20mm. chiều dài từ mắt kép đến cuối bụng là 21-25mm Ấu trùng sống ở dưới đất và ăn các lớp mùn thảm thực vật rừng nơi phân bố. Ấu trùng loài này lột xác vào đầu mùa mưa hàng năm', NULL, 'Phú Thọ, Vĩnh Phúc (Tam Đảo), Lạng Sơn, Lai Châu, Lào Cai, Yên Bái, Cao Bằng, Ninh Bình  (Cúc Phương). ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1151, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Fulgoridae', 'Ve Sầu Đầu Dài', 'FAM_153', 'Pyrops', NULL, 'GEN_1700', 'pyropsclavata', 'Pyrops clavata', '(Westwood, 1839)', NULL, 'SPA_01155', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1152, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Fulgoridae', 'Ve Sầu Đầu Dài', 'FAM_153', 'Pyrops', NULL, 'GEN_1700', 'pyropsspinolae', 'Pyrops spinolae', '(Westwood, 1842).', 'Ve Sầu Vòi Voi Đầu Xám ', 'SPA_01156', 'Loài côn trùng lạ, có sải cánh dài 70-73mm. Đầu (gồm cả phần kéo dài) phía trên và hai bên có màu đen với các đốm trắng nhỏ không đều, phía dưới màu vàng đất. Mảnh lưng ngực trước và mảnh lưng ngực giữa  có màu vàng đấy hay màu vàng hơi xanh lá câyở phía trên, giữa có vệt màu đen chạy dọc mảnh lưng ngực trước và mảnh lưng ngực giữa. Có 3 đốm nhỏ ở mỗi bên mép trước, một đốm rộng xiên, hai đốm nhỏ ở phía sau kéo dài tới mảnh lưng ngực giữa màu đen. Bụng, thân dưới và chân màu vàng đất. Vòi, đốt ống và bàn chân có màu đen hoặc tím than.\nCánh trước phần từ gốc đến 2/3 cánh có màu xanh lá cây đậm, tiếp theo là màu nâu nhạt, sát gốc cánh có một vệt màu vàng đất và 2 vệt màu vàng đất xiên chéo nhau, có 3 đốm màu vàng đất xếp thành hàng xiên, 5 đốm chạy ngang cánh ở vùng chót cánh cũng có màu vàng đất với nép ngoài màu trắng. Các đốm không đều ở vùng ngọn cành có kích thước nhỏ hơn. Cánh sau ở vùng ngọn cánh có màu tím than. Tất cả phần còn lại có màu vàng rơm.\nChiều dài từ đỉnh đầu đến mắt kép là 16-20mm, chiều dài từ mắt kép đến cuối bụng khoảng 22-23mm. Ấu trùng sống ở dưới đất và ăn các lớp mùn thảm thực vật rừng nơi phân bố. Ở Nam bộ ấu trùng loài này lột xác vào đầu mùa mưa (tháng 5) hàng năm.', NULL, 'Phú Thọ, Vĩnh Phúc (Tam Đảo), Ninh Bình  (Cúc Phương) và Đồng Nai. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1153, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Fulgoridae', 'Ve Sầu Đầu Dài', 'FAM_153', 'Saiva', NULL, 'GEN_1768', 'saivagemmata', 'Saiva gemmata', '(Westwood, 1848) ', NULL, 'SPA_01157', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1154, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Issidae', 'Rầy Cánh Ngắn', 'FAM_201', 'Brahmaloka', NULL, 'GEN_0251', 'brahmalokasp1', 'Brahmaloka sp1', NULL, NULL, 'SPA_01158', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1155, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Issidae', 'Rầy Cánh Ngắn', 'FAM_201', 'Tatva', NULL, 'GEN_1916', 'tatvabufo', 'Tatva bufo', 'Distant, 1906', NULL, 'SPA_01159', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1156, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Laccifridae', 'Cánh Kiến Đỏ', 'FAM_205', 'Kerria', NULL, 'GEN_0997', 'kerrialacca', 'Kerria lacca', '(Kerr, 1782)', 'Cánh kiến đỏ', 'SPA_01160', 'Côn trùng có kích thước nhỏ, con đực dài khoảng 1,5 mm - 2 mm. Con cái thân dài 4,5 - 5 mm. Con đực có cánh hoặc không cánh (thường không cánh). Con cái không cánh, ấu trùng dạng cái thuyền, màu đỏ, kích thước khoảng 0,50 x 0,25 mm Một con cái có thể sinh ra 300 - 1.000 trứng, đẻ trong vòng 4 - 12 ngày. Chỉ một thời gian ngắn sau khi nở ấu trùng bò ra khỏi phòng nhựa để tìm nơi định c­ lập tổ mới ở các cành cây nhỏ. Tỷ lệ đực cái trong một đàn thường là 1/3. Mật độ cư trú ở một tổ cánh kiến thường là 150 - 180 ấu trùng trên 1 cm2 của cành cây. Sau 1 tuần định c­a ấu trùng bắt đầu tiết nhựa. Nhựa được tiết ra từ các tuyến trên lớp kitin phủ thân ấu trùng, trừ vùng hậu môn và lỗ thờ là không có tuyến nhựa. Qua 3 lần lột xác ấu trùng trở thành con trưởng thành. Thời gian hoàn thành 3 lần lột xác dài hay ngắn phụ thuộc vào điều kiện môi trường. Cánh kiến đỏ phát triển được thì cần phải có 3 điều kiện chính: nhiệt độ, độ ẩm và cây chủ, có khoảng hơn 100 loài chủ của Cánh kiến đỏ, bao gồm cả cây trồng và cây dại. Cây chủ chính của cánh kiến ở nước ta là: Đậu thiều Cajanus cajan, Cọ phèn Protium serratum, Sung Ficus glomerata, Đề Ficus religiosa, Si Ficus glomerata, Táo ta Ziziphus mauritiana, Vải Nephelium litchi... Cánh kiến đỏ phát triển tốt ở độ cao 500 - 700m. Cánh kiến đỏ phát triển trong mùa khô tốt hơn trong mùa m­ưa.', NULL, 'Phổ biến trên toàn lãnh thổ Việt Nam Ấn Độ, các nước Đông nam Á và Trung Quốc', NULL, NULL, 'Nhựa cánh kiến đỏ là nguyên liệu chính làm Sen-lắc, véc-ni đánh bóng đồ gỗ và dùng trong nhiều nghành công nghiệp điện tử. Vì nó là một loại cao phân tử có nhiều tính chất lý hóa đặc biệt nên được ứng dụng trong nhiều ngành công nghiệp quan trọng. Chất màu của Cánh kiến đỏ trước kia được sử dụng trong công nghiệp nhuộm, nay được sử dụng chủ yếu trong công nghiệp thực phẩm và dược phẩm và ngày càng được ưa chuộng. Là đặc sản và hàng có giá trị xuất khẩu của nước ta. Nuôi trồng Cánh kiến đỏ đúng kỹ thuật có thể dễ dàng cho thu hoạch bằng giá trị 25 - 45 tấn thóc trên 1 ha', 'Bậc V', NULL, NULL, 'VN Creature'),
