(1166, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Ricaniidae', 'Ve Sầu Bướm Xám', 'FAM_322', 'Ricania', NULL, 'GEN_1753', 'ricaniamarginalis', 'Ricania marginalis', '(Walker, 1851)', NULL, 'SPA_01170', 'Chiều dài cơ thể 7mm, sải cánh khoảng 21mm; thân màu nâu đến nâu sẫm; cánh trước cũng có màu nâu sẫm, màu của mép sau hơi nhạt, mép trước có đốm trong suốt hình tam giác, mép sau có hai đốm trong suốt không đều, một lớn và một nhỏ. Các đốm nhỏ trong suốt rải rác; bột sáp trắng rải rác trên bề mặt cánh; cánh sau mờ nâu đen. Nó được tìm thấy trên cành của nhiều loại cây. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
