(1169, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Ricaniidae', 'Ve Sầu Bướm Xám', 'FAM_322', 'Ricania', NULL, 'GEN_1753', 'ricaniasp2', 'Ricania sp2', NULL, NULL, 'SPA_01173', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1170, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HOMOPTERA', 'CÁNH GIỐNG', 'ORD_042', 'Ricaniidae', 'Ve Sầu Bướm Xám', 'FAM_322', 'Ricania', NULL, 'GEN_1753', 'ricaniaspeculum', 'Ricania speculum', '(Walker, 1851)', NULL, 'SPA_01174', 'Ricania speculum có thể đạt chiều dài khoảng 8 milimét (0,31 in), với sải cánh khoảng 15 milimét (0,59 in). Những con rầy này có đôi cánh màu nâu sẫm với các dải ngang lượn sóng ở giữa và các mảng trong suốt không đều có kích thước khác nhau. Vùng trước sườn của cánh trước có các gân ngang dày đặc và rìa sườn lồi rõ rệt ở gần gốc. Ở con đực, đầu bụng nhọn, trong khi ở con cái thì tròn. Nhộng giai đoạn cuối có màu trắng với các mảng màu nâu sẫm và tiết ra chất sáp ở bụng.  Những loài côn trùng này ăn nhựa cây mà chúng hút từ lá của cây chủ. Ricania speculum có một thế hệ mỗi năm. Trứng trú đông trong vỏ cành chờ nở mùa xuân.', NULL, ' Trung Quốc, Ấn Độ, Indonesia, Nhật Bản, Hàn Quốc, Philippines ', NULL, NULL, NULL, NULL, NULL, NULL, 'en.wikipedia.org'),
