(1186, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HYMENOPTERA', 'CÁNH MÀNG', 'ORD_043', 'Apidae', 'Ong Mật', 'FAM_027', 'Xylocopa', NULL, 'GEN_2055', 'xylocopacaerulea', 'Xylocopa caerulea', 'Fabricius, 1804', NULL, 'SPA_01190', 'Xylocopa caerulea là một loài tương đối lớn, đạt kích thước trung bình 23 mm (0,91 in). Vùng ngực của loài này được bao phủ bởi những sợi lông màu xanh lam nhạt, tạo cho nó một màu xanh lam nổi bật. Hai bên của bụng và các đoạn bụng đầu tiên cũng được bao phủ bởi lớp lông tương tự, mặc dù một lớp lông màu xanh lam mỏng hơn và mịn hơn. ', NULL, '  Đông Nam Á, Ấn Độ và vùng Hoa Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'vi.wikipedia.org'),
