(1333, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HYMENOPTERA', 'CÁNH MÀNG', 'ORD_043', 'Formicidae', 'Kiến', 'FAM_151', 'Polyrhachis', NULL, 'GEN_1604', 'polyrhachisdives', 'Polyrhachis dives', NULL, 'Kiến đen ', 'SPA_01337', ' Toàn thân dài 1,3 – 1,5 cm, Có màu nâu đậm hoặc đen, Không chích Kiến chúa trú đông trong đất. Trứng được đẻ vào cuối mùa xuân. Ấu trùng nở sau 3-4 tuần.\nẤu trùng sống nhờ các chất tiết ra từ tuyến nước bọt của kiến chúa cho đến khi trưởng thành.Kiến thợ tiếp tục chăm sóc ấu trùng, xây tổ và tìm thức ăn.\nKiến đực khỏe cũng được sinh ra trong mùa sinh sản.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'vietnampcs.vn'),
