(1339, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HYMENOPTERA', 'CÁNH MÀNG', 'ORD_043', 'Formicidae', 'Kiến', 'FAM_151', 'Polyrhachis', NULL, 'GEN_1604', 'polyrhachissp', 'Polyrhachis sp', NULL, NULL, 'SPA_01343', 'Kích thước: Kiến thợ có kích thước dài khoảng 5–10 mm. Mắt phát triển, không có ocelli . Ăng-ten có 12 đoạn. Phần bám của ăng-ten nằm cách xa rìa sau của clypeus . Mesosoma của hầu hết các loài đều có gai trên một hoặc nhiều thành phần pronotal, mesonotal hoặc propodeal của nó. Cuống lá được trang bị gai hoặc răng. Tergite dạ dày đầu tiên phát triển tốt, nhìn từ mặt lưng dài hơn các phần lộ ra của terga sau cùng. Mở ở đỉnh dạ dày để giải phóng nọc độc không có viền lông xuyên tâm', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Polyrhachis'),
