(1412, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HYMENOPTERA', 'CÁNH MÀNG', 'ORD_043', 'Ichneumonidae', 'Ong Cự', 'FAM_196', 'Xanthopimpla', NULL, 'GEN_2044', 'xanthopimplapunctata', 'Xanthopimpla punctata', '(Fabricius, 1781)', NULL, 'SPA_01416', 'Hình dạng cơ thể thay đổi rất nhiều, chiều dài cơ thể (không bao gồm râu và vòi trứng) là 3-40mm, với hơn 10-20mm; râu mảnh, dạng sợi và nhiều đoạn; 3 ống đơn, miệng phát triển tốt; 2 đoạn trochanteric, Các xương chày có một cựa rõ rệt, các mấu có 5 đoạn, các móng vuốt khỏe và có phần nhô ra giữa các móng; các cánh nói chung phát triển, đôi khi không có cánh và cánh ngắn, các gân dẫn trước và gân phụ lành lại, các gân có cánh. , cubital Đoạn cơ sở của tĩnh mạch biến mất, và khoang hình khối đầu tiên và khoang đĩa thứ nhất hợp nhất thành khoang hình khối, với một tĩnh mạch thứ hai; phần đáy của bụng co thắt lại, có cuống hoặc hơi giống cuống, nhìn chung mảnh , hình mắt lưới, hình bầu dục, Dẹt và phẳng ở mặt bên; các vòi trứng khác nhau về chiều dài ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
