(1456, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HYMENOPTERA', 'CÁNH MÀNG', 'ORD_043', 'Scelionidae', NULL, 'FAM_331', 'Scelio', NULL, 'GEN_1787', 'sceliohomona', 'Scelio homona', 'Kozlov et Le, 1988', NULL, 'SPA_01460', 'Ong đực: Đầu có chiều rộng lớn hơn chiều dài 1,6 lần. Đỉnh đầu sau mắt đơn sau không gấp khúc đột ngột. Thái dơng có chiều rộng nhỏ hơn chiều rộng của mắt kép. Đỉnh đầu và trán có vân dạng rỗ tổ Ong nhỏ. Má xen kẽ vân dạng rỗ tổ Ong nhỏ với những đờng rãnh xếp thành hình dẻ quạt. Mắt kép trơn. Râu 10 đốt, hình sợi. Đốt gốc có chiều dài lớn hơn chiều rộng 4 lần và 4,8 lần dài hơn đốt râu 2. Đốt râu 2 có chiều dài bằng chiều rộng (5:5), ngắn hơn chiều dài của đốt râu 3 (5:8). Đốt râu 3 có chiều rộng lớn hơn chiều rộng của đốt râu 2 (6:5). Đốt râu 4 và 6 có chiều dài và chiều rộng bằng nhau, chiều dài của mỗi đốt nhỏ hơn chiều rộng của chính đốt ấy (5 - 6). Đốt râu 5 rộng và dài hơn đốt râu 6, chiều rộng và chiều dài của đốt râu này bằng nhau (8:8). Đốt râu 7 - 9 có chiều rộng bằng chiều dài (5:5). Đốt râu 10 có chiều dài lớn hơn chiều rộng (9: 5).\nNgực có chiều dài lớn hơn chiều rộng, chiều rộng của nó lớn hơn chiều rộng của bụng, hơi hẹp hơn chiều rộng của đầu. Tấm lng ngực giữa không có rãnh lng. Trên bề mặt của ngực có vân giống nh vân trên đầu.\nBụng có chiều dài lớn hơn chiều rộng 3 lần. Tấm lng thứ nhất của bụng có chiều rộng lớn hơn chiều dài (22:15), chiều dài của nó nhỏ hơn chiều dài của tấm lng thứ 2 (15:18). Tấm lng thứ 2 có chiều rộng lớn hơn chiều dài 1,7 lần. Tấm lng thứ 3 dài hơn tấm lng khác của bụng, chiều rộng của tấm lng này hơi lớn hơn chiều dài của nó (35:30). Tỷ lệ giữa chiều dài và chiều rộng của các tấm lng còn lại nh sau: 15:25; 8:18; 4:12. Trên các tấm lng thứ nhất đến thứ 6 của bụng có những đờng rãnh dọc. Tấm lng thứ 7 có vân dạng hạt nhỏ.\nĐầu màu đen. Ngực màu nâu đen. Bụng màu nâu đỏ. Râu, hàm trên, chân màu nâu vàng, mắt kép màu da cam.\nOng đực và sinh học cha rõ.', NULL, 'Việt Nam: Quảng Ngãi.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.'),
