(1537, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HYMENOPTERA', 'CÁNH MÀNG', 'ORD_043', 'Vespidae', 'Ong Vò Vẽ', 'FAM_392', 'Vespa', NULL, 'GEN_2032', 'vespasoror', 'Vespa soror', 'Buysson, 1905', NULL, 'SPA_01541', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1538, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HYMENOPTERA', 'CÁNH MÀNG', 'ORD_043', 'Vespidae', 'Ong Vò Vẽ', 'FAM_392', 'Vespa', NULL, 'GEN_2032', 'vespatropica', 'Vespa tropica', 'Linnaeus, 1758', NULL, 'SPA_01542', 'Kiến thợ của Vespa tropica dài khoảng 24–26 milimét, trong khi kiến ​​chúa dài tới 30 milimét. Đầu có màu nâu sẫm/đỏ; bụng màu đen với một sọc màu vàng rõ rệt bao phủ hầu hết đốt bụng thứ hai. Tuy nhiên, có một số khác biệt trong phạm vi phân bố của nó và ở Singapore và Đông Nam Á, mẫu vật thường có màu đen hoàn toàn và kích thước lớn hơn, trong khi ở các khu vực khác như Hồng Kông , đầu và hai bên ngực thường có màu đỏ. Dạng màu thứ ba được tìm thấy ở Andamans và Nicobars , chúng có đầu và ngực màu nâu đỏ và tất cả các tấm lưng trên mỗi đoạn của dạ dày đều có màu cam ngoại trừ tấm đầu tiên.  ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'en.wikipedia.org'),
(1539, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'HYMENOPTERA', 'CÁNH MÀNG', 'ORD_043', 'Vespidae', 'Ong Vò Vẽ', 'FAM_392', 'Vespa', NULL, 'GEN_2032', 'vespavelutina', 'Vespa velutina', 'Lepeletier, 1836', 'Ong Mặt Quỷ ', 'SPA_01543', 'Vespa velutina nhỏ hơn ong bắp cày châu Âu. Ong chúa dài 30 mm và ong đực dải khoảng  24 mm. Ong thợ dài khoảng 20 mm.[4] Chúng sinh sống thành các đàn lớn có số lượng lên đến hàng ngàn con trong một chiếc tổ thường dài ít nhất nửa mét. Chế độ ăn rất đa dạng, chủ yếu là những loài côn trùng như: ruồi, chuồn chuồn và đặc biệt là cả ong mật. Chúng có biệt danh \"chim ưng của thế giới côn trùng\" do cách săn mồi chớp nhoáng của loài ong này. Khi tìm được một tổ ong mật, chúng sẽ bay lượn, rình rập xung quanh mục tiêu và chỉ cần bất kỳ con ong mật nào mất cảnh giác, loài ong này bất thình lình bổ nhào tới bắt gọn con mồi ngay giữa không trung và tha về tổ để làm thức ăn cho ấu trùng của chúng. ', NULL, ' Đông Nam Á, đặc biệt là các vùng nhiệt đới, từ Bắc Ấn Độ, Pakistan, Afghanistan, Bhutan, Trung Quốc, Đài Loan, Miến Điện, Thái Lan, Lào, Việt Nam, Malaysia, bán đảo Ấn-Trung và các quần đảo xung quanh.', NULL, NULL, NULL, NULL, NULL, NULL, 'vi.wikipedia.org'),
