(1543, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ISOPTERA', 'CÁNH BẰNG', 'ORD_045', 'Termitidae', 'Mối', 'FAM_366', 'Odontotermes', NULL, 'GEN_1361', 'odontotermesassnuthi', 'Odontotermes assnuthi', '(Wasmann, 1902)', NULL, 'SPA_01547', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1544, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ISOPTERA', 'CÁNH BẰNG', 'ORD_045', 'Termitidae', 'Mối', 'FAM_366', 'Odontotermes', NULL, 'GEN_1361', 'odontotermesformosanus', 'Odontotermes formosanus', '(Shiraki, 1909)', NULL, 'SPA_01548', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1545, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ISOPTERA', 'CÁNH BẰNG', 'ORD_045', 'Termitidae', 'Mối', 'FAM_366', 'Odontotermes', NULL, 'GEN_1361', 'odontotermessp1', 'Odontotermes sp1', NULL, NULL, 'SPA_01549', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1546, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Amathusiidae', 'Bướm Rừng', 'FAM_013', 'Aemona', NULL, 'GEN_0039', 'aemonaamathusia', 'Aemona amathusia', '(Hewitson, 1867). ', 'Bướm nữ thân vàng', 'SPA_01550', 'Đặc điểm nhận dạng:\n\nMặt dưới 2 cánh có màu nâu nhạt, các gân 8,9,10 phát sinh từ gân 7 và gân 11, gân 12 nối nhau và hướng tới viền trên ở khoảng giữa. Đỉnh cánh trước nhọn và kéo dài. Mặt trên bướm có màu nâu đồng, chót cánh trước có mảng màu nâu đen. Khi đậu chúng thường khép cánh nên thường không nhìn thấy mặt cánh trên.\n\nSinh học, sinh thái:\n\nLoài này chỉ gặp sống trong các khu rừng tự nhiên. Không phổ biến. Sống ở độ cao dưới 1.200m, nhiều hơn khi xuống thấp ở các khu rừng nguyên sinh. Khi xuống thấp dưới 700m còn thấy chúng sinh sống ở các khu rừng thứ sinh. Đây là loài bướm rất hiếm gặp.', NULL, 'Loài có vùng phân bố rộng từ Ấn Độ đến Bhutan, Assam, Manipur, Burma và Tây nam Trung Quốc. Ở Việt Nam loài này sống ở các tỉnh phía Bắc.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.'),
(1547, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Amathusiidae', 'Bướm Rừng', 'FAM_013', 'Enispe', NULL, 'GEN_0651', 'enispecycnus', 'Enispe cycnus', '(Westwood, 1851)', NULL, 'SPA_01551', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1548, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Amathusiidae', 'Bướm Rừng', 'FAM_013', 'Faunis', NULL, 'GEN_0711', 'faunisaerope', 'Faunis aerope', '(Leech, 1890) ', NULL, 'SPA_01552', 'Hai cánh có đường cơ sở gợn sóng màu nâu, một đường giữa và một đường cuối, và một hàng chấm trắng có kích thước khác nhau ở giữa.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.'),
(1549, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Amathusiidae', 'Bướm Rừng', 'FAM_013', 'Faunis', NULL, 'GEN_0711', 'fauniscanens', 'Faunis canens arcesilas', 'Hübner, 1826', NULL, 'SPA_01553', 'Đặc điểm nhận dạng:\n\nLà giống bao gồm những loài bướm nhỏ của họ Bướm rừng Amathussidae. Viền trong cánh trước của nó có dạng thuỳ ở gần gốc. Ở cánh trước, gân 10 phát sinh từ giữa của gân 7, gân 8,9,10 phát sinh gần cùng nhau. Ở mặt dưới con đực có một vệt là các vảy có mùi đặc trưng. Mặt dưới cánh sau con đực dưới gân trụ cánh, về phía gốc của gân 1b, có hai khóm lông xếp chồng lên nhau. Đặc điểm này bị biến mất ở F.gracilis. Loài F.canens Bướm cái và bướm đực gần giống nhau và ở mặt trên phía cánh trước có hàng chấm nhỏ màu trắng.có mặt trên con đực màu nâu tối tới đất son và không hề có hoa văn nào. Con cái giống con đực, nhưng đỉnh trên và viền ngoài cánh tối hơn một chút; mặt duới: màu nâu đậm, dải ở giữa hình lưỡi liềm và hẹp, các chấm phân bố theo dải này chỉ là những chấm nhỏ li ti ở cả cánh trước và cánh sau.\n\nSinh học sinh thái:\n\nChỉ sống ở những nơi có rừng hoặc bìa rừng, đây là đặc tính riêng của cả họ Bướm rừng Amathusiidae.', NULL, 'Từ Sikkim tới Mianma, Thái Lan, Malaixia, Inđônêxia, Việt Nam.Phân bố ở độ cao dưới 1.200m, nhiều hơn khi xuống thấp, trong các khu rừng.', NULL, NULL, 'Các loài Bướm rừng nói chung và loài Faunis canens nói riêng là những loài bướm thường có cánh rộng, bay chậm và chỉ sống ở nơi có rừng.Chúng là một trong những loài bướm đẹp và giữ vai trò chỉ thị quan trọng. Ở đâu còn có chúng thì ở đó có rừng. Do đó cần bảo vệ rừng tự nhiên - là nơi cư trú duy nhất của loài này.', NULL, NULL, NULL, 'vncreatures.'),
(1550, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Amathusiidae', 'Bướm Rừng', 'FAM_013', 'Faunis', NULL, 'GEN_0711', 'fauniseumeus', 'Faunis eumeus incerta', '(Staudinger, [1887])', '', 'SPA_01554', 'Ngoài các đặc điểm chung của giống, loài này có các đặc điểm sau: Mặt trên: con đực có màu nâu tới màu đất son; con cái : cánh trước có dải sát đỉnh trên màu vàng rõ hơn ở con đực. Mặt dưới: con đực và cái có cánh trước có đường giữa cánh cong về phía trước, ở cả hai cánh, đốm nhỏ với các cỡ lớn nhỏ khác nhau và có màu vàng. Bướm cái và đực giống nhau nhưng bướm cái thường lớn hơn. Loài này lớn hơn loài Faunis canens, thậm chí lớn hơn rất nhiều. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(1551, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Amathusiidae', 'Bướm Rừng', 'FAM_013', 'Stichophthalma', NULL, 'GEN_1864', 'stichophthalmacambodia', 'Stichopthalma cambodia', '(Hewitson, 1862)', '', 'SPA_01555', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1552, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Amathusiidae', 'Bướm Rừng', 'FAM_013', 'Stichophthalma', NULL, 'GEN_1864', 'stichophthalmafruhstorferi', 'Stichophthalma fruhstorferi', 'Röber, 1903', NULL, 'SPA_01556', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1553, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Amathusiidae', 'Bướm Rừng', 'FAM_013', 'Stichophthalma', NULL, 'GEN_1864', 'stichophthalmahowqua', 'Stichophthalma howqua tonkiniana', '(Westwood, 1851)', NULL, 'SPA_01557', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1554, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Amathusiidae', 'Bướm Rừng', 'FAM_013', 'Stichophthalma', NULL, 'GEN_1864', 'stichophthalmalouisa', 'Stichophthalma louisa', 'Wood-Mason, 1877', NULL, 'SPA_01558', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1555, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Amathusiidae', 'Bướm Rừng', 'FAM_013', 'Stichophthalma', NULL, 'GEN_1864', 'stichophthalmauemurai', 'Stichophthalma uemurai', 'Nishimura, 1998', 'Bướm chúa rừng nhiệt đới', 'SPA_01559', 'Bướm đực và cái giống nhau nhưng con cái hơi to hơn. Mặt trên: Màu nền nửa cánh phía nách cánh màu xám xanh với lốm đốm lông tơ màu nâu. Nửa đỉnh cánh trước trắng với vài điểm xanh, phấn trắng bao xung quanh mạch cánh. Nửa đỉnh cánh sau màu xám xanh với màu hoa cà nhạt hoặc trơn (ở loài phụ gialai), có khía dải đen ở đầu và mép ngoài cánh. Mặt dưới: Màu nền cả hai cánh nâu vàng. Giữa khoảng cánh 2 và 5 cánh trước và giữa khoang 2 và 6 cánh sau có các đốm tròn vòng màu nâu - da cam, có điểm trắng ở giữa và viền đen xung quanh. Chiều dài cánh trước 55 - 58mm ở con đực và 61 - 69mm ở con cái. Có hai phân loài ở Việt Nam. Mẫu thu được ở Gia Lai có màu sẫm hơn ở Lâm Đồng Sống trong rừng thường xanh nguyên sinh và thứ sinh và rừng tre nứa ở độ cao vừa phải (400 - 800m). Xuất hiện theo mùa vào cuối mùa khô. Qua các năm, loài này được phát hiện khá phong phú tuy nhiên mật độ quần thể biến động. Cá thể trưởng thành bay rất gần mặt đất và thích hoa quả thối rữa và phân động vật', NULL, 'Gia Lai (Kon Cha Rang), Lâm Đồng (Bảo Lộc, Cát Lộc). Vướn quốc gia Bù Gia Mập, Vườn quốc gia Konkakinh ', NULL, 'Loài đặc hữu của Việt Nam', 'Có giá trị nghiên cứu khoa học', ' VU A2c,d B1 + 2b', NULL, NULL, 'VN Creature'),
(1556, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Amathusiidae', 'Bướm Rừng', 'FAM_013', 'Thaumantis', NULL, 'GEN_1950', 'thaumantisdiores', 'Thaumantis diores', 'Doubleday, 1845', '  ', 'SPA_01560', 'Đặc điểm giống: gồm những loài bướm to có màu nâu tối với  gốc màu tía. Có viền cánh trước hình vòm và đỉnh trên tròn. Gân 11 nối với gân 12 và gân 10 xuất phát từ gân 7 xa đỉnh vùng trung tâm, nối với gân 11. Vùng trung tâm cánh sau mở. Con cái có dải hơi trắng gần chót cánh trước cong và mặt dưới của con cái có một đường giữa sát mép ngoài cánh màu trắng. Loài T.diores có con cái và đực màu nâu tối. Cánh trước có một dải xanh nhạt lớn kéo dài từ giữa mép trên xuống tận gân 2, dải này không chạm tới vùng trung tâm. Ở cánh sau là một vệt giữa cánh lớn cũng màu xanh dương tía với gân 6 bên trên và kéo dài xuống gân 2. Mặt dưới có màu nâu mượt mà, với viền ngoài cánh nâu sáng mang theo một đường lượn sóng sát mép cánh. Ở cánh sau có đốm trắng vàng nhạt hình ôvan ở khoảng 6 và một đốm màu đen ở khoảng 2 thuộc vùng trung tâm, có một đốm đen nữa ở góc đuôi cánh. Sải cánh: 95-115mm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1557, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Amathusiidae', 'Bướm Rừng', 'FAM_013', 'Thauria', NULL, 'GEN_1951', 'thauriaaliris', 'Thauria aliris', '(Westwood, 1858).', '', 'SPA_01561', 'Loài bướm có kích thước lớn, bướm cái và bướm đực khá giống nhau. Mặt cánh trên gồm 3 màu vàng cam ở phần gốc dưới của cánh sau, cánh trước mỗi bên có sọc lớn màu trắng ở phần giữa cánh và một sọc trắng đứt đọan ở gần viền cánh ngoài. Mặt cánh dưới có 2 đốm mắt rất lớn ở cánh sau, một vòng tròn màu đen nằm lệch vào phía trong gốc cánh Đây là nhóm bướm sống dưới tán rừng, rất ít gặp ngoài trảng trống, phần lớn sống trong rừng hoặc gần rừng. Khi đậu chúng thường khép cánh nên ít khi nhìn thấy mặt trên cánh. Thường hoạt động mạnh lúc sáng sớm và chiều tối, bay thấp, sát mặt đất, len lỏi giữa các bụi cây. Sâu của chúng có nhiều lông dài, thức ăn của sâu non là nhiều loài trong họ cỏ Poaceae và bướm thường bị hấp dẫn bới trái cây chín rụng dưới đất và chất thải của các loài động vật trong rừng . Xuất hiện chủ yếu ở những vùng thấp và đồi gò ở các khu rừng lồ ồ, tre, nứa hoặc những con suối cạn vào mùa khô', NULL, 'Các tỉnh có núi rừng từ Bắc đến Nam Vùng phân bố từ Borneo và Maylaysia đến Thái Lan và qua lục địa Đông nam châu Á', NULL, NULL, NULL, NULL, NULL, NULL, 'VN Creature'),
(1558, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Amathusiidae', 'Bướm Rừng', 'FAM_013', 'Thauria', NULL, 'GEN_1951', 'thaurialathyi', 'Thauria lathyi lathyi', 'Frühstorfer, 1902', NULL, 'SPA_01562', 'có sải cánh dài từ 75 đến 100 mm, trên bề mặt cánh có nền màu nâu sẫm, dải xiên màu vàng trung bình rộng ở giữa cánh trước, một đốm nhỏ màu trắng ở góc trên và màu cam sẫm. quầng từ mép của cánh sau vào mặt trong của cánh. Mặt sau có hai đốm mắt hình tròn lớn, ở khoang giữa không có búi lông dài.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.'),
(1559, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Amathusiidae', 'Bướm Rừng', 'FAM_013', 'Xanthotaenia', NULL, 'GEN_2045', 'xanthotaeniabusiris', 'Xanthotaenia busiris', '(Westwood, [1858])', '  ', 'SPA_01563', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1560, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Danaus', NULL, 'GEN_0546', 'danauschrysippus', 'Danaus chrysippus chrysippus', '(Linnaeus, 1758)', 'Bướm hổ cam ', 'SPA_01564', 'Là loài bướm phố biến trong họ này ở Việt Nam. Rất dễ nhận diện nhờ màu cam sành chín, chót cánh trước màu đen với chấm và băng trắng ở giữa.Viền cánh sau có vòng hạt cườm đơn đen - trắng và có 5 chấm đen với kích cỡ khác nhau rải theo đường zic zắc từ mép trên cánh đến 2/3 đĩa cánh về phía gần mép trong cánh. Mặt dưới cánh nhạt màu hơn và có thể nhầm lẫn với loài Danaus genutia. Sải cánh: 70 - 80mm. Thường gặp ở khu vực trống, bãi đất hoang có nắng. Rất phổ biến ở khu vực ven biển miền Trung, nơi có rất nhiều cây Bòng bòng (Calotropis gigantea), họ Thiên lý Asclepiadaceae là loại cây chủ chính của sâu non. Có thể thấy chúng bay ở những vùng trống khi có gió mạnh, không \"quản ngại\" việc bị gió thổi bạt đi.  Khá phổ biến. Sống ở mọi độ cao trong các khu rừng thứ sinh, nhiều hơn ở các trảng cỏ, cây bụi và các khu nông nghiệp.', NULL, 'Phân bố toàn Việt Nam  Ấn Độ sang Trung Quốc, phía nam tới Đông Dương, quần đảo Malaixia và Châu Úc.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1561, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Danaus', NULL, 'GEN_0546', 'danausgenutia', 'Danaus genutia genutia', '(Cramer, [1779])', '', 'SPA_01565', 'Đây cũng là một loài đặc trưng, nhưng có thể nhầm lẫn với loài Danaus affinis trong giống Danaus. Loài này có màu cam sậm hơn so với Danaus chrysippus, với màu đen chạy dọc các đường gân cánh rõ ràng. Ở miền Nam cũng có thể gặp một loài khác tương tự là Danaus affinis, phân biệt dễ dàng nhờ cánh sau có màu nền trắng, các đường gân chính phủ vẩy đen, mép cánh đen. Sải cánh: 75 - 95mm. Bướm thường ưa chỗ trống và sáng. Mặc dù là loài phổ biến nhưng ít khi gặp với số lượng lớn. Đẻ trứng trên các loại cây thuộc họ Thiên lý Asclepiadacea. Được ghi nhận đẻ trứng, trên cây trúc đào cảnh Nerium oleander, họ Trúc đào Apocynaceae. Do thức ăn là loài cây có độc nên chúng không bị các loài thiên địch như chim ăn nên thường gây ra tác hại lớn với khu vực trồng cây cảnh Trúc đào. Bướm có thể dễ dàng gặp ở những nơi vùng đất thấp và đồng bằng, gần những nơi có cây trồng và thậm chí chúng sống ở những sinh cảnh bị xáo trộn do việc chặt phá rừng trở thành đất trống đồi trọc. Bướm thường đậu trên hoa cỏ, cây bụi cạnh vườn, công viên thành phố và thích hút mật các loài cây thuộc chi Đơn buốt, Bông ổi, Cỏ hôi, Đại bi. Sâu non sống trên nhiều loài cây khác thuộc họ Thiên lý. Loài này khá phổ biến ở các độ cao thấp và các môi trường khác nhau ngoại trừ các rừng nguyên sinh ở độ cao trên 700m, phổ biến nhất ở trong các khu đất trống, trảng cỏ, cây bụi.', NULL, 'Loài này xuất hiện quanh năm ở Việt Nam. Tên bướm được dịch nghĩa từ tiếng Anh. Vùng phân bố của loài này theo hướng Đông từ Srilanca và Ấn Độ đến Nam Trung Quốc và phía Nam qua Mianma, Thái Lan và Đông Dương đến bán đảo Malaysia và xa hơn qua quần đảo Sandra đến Australia.', NULL, NULL, 'Tương tự như loài Danaus chrysippus nhưng loài Danaus gentutia hay bắt gặp hơn ở ngoài thiên nhiên. Loài này cũng nên nuôi ở trang trại.', NULL, NULL, NULL, 'vncreatures.net'),
(1562, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Danaus', NULL, 'GEN_0546', 'danausmelanippus', 'Danaus melanippus hegesippus', '(Cramer, [1777])', '', 'SPA_01566', 'Đặc điểm nhận dạng:\n\nBướm có kích thước nhỏ và có đặc trưng không thể nhầm lẫn với loài nào trong nhóm bướm này. Loài này có màu cam sậm hơn so với Danaus chrysippus, với màu đen chạy dọc các đường gân cánh rõ ràng. Cánh trước tương tự loài Danaus genutia, nhưng dễ dàng phân biệt với Danaus genutia nhờ mặt trên cánh sau không có màu cam mà chỉ có hai màu trắng và đen, với kích thước nhỏ hơn Danaus genutia. Sải cánh: 70 - 72mm.\n\nSinh học sinh thái:\n\nBướm thường ưa chỗ trống và sáng. Mặc dù là loài phổ biến nhưng ít khi gặp với số lượng lớn. Đẻ trứng trên các loại cây thuộc họ Thiên lý Asclepiadacea, họ Cúc Asteraceae và đã ghi nhận bướm cái đẻ trứng trên cây Cỏ hôi Ageratum conyzoides. Bướm có thể dễ dàng gặp ở những nơi vùng đất thấp và đồng bằng, rừng ngập mặn, gần những nơi có cây trồng và thậm chí chúng sống ở những sinh cảnh bị xáo trộn do việc chặt phá rừng trở thành đất trống đồi trọc. Bướm thường đậu trên hoa cỏ, cây bụi cạnh vườn, công viên thành phố và thích hút mật các loài cây thuộc chi Đơn buốt, Bông ổi, Cỏ hôi, Đại bi. Sâu non sống trên nhiều loài cây khác thuộc họ Thiên lý Asclepiadacea, họ Cúc Asteraceae. Loài này khá phổ biến ở miền Tây nam bộ trong các khu rừng ngập mặn và còn có ở Phú Quốc', NULL, 'Vùng phân bố của loài này theo hướng Đông từ Srilanca và Ấn Độ đến Nam Trung Quốc và phía Nam qua Mianma, Thái Lan và Đông Dương đến bán đảo Malaysiai và xa hơn qua quần đảo Sanđa đến Australia. Loài này xuất hiện quanh năm ở Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1563, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploeaalgea', 'Euploea aglea', '(Godart, 1819)', '  ', 'SPA_01567', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1564, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploeacamaralzeman', 'Euploea camaralzeman camaralzeman', '(Butler, 1866)', '', 'SPA_01568', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1565, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploeacore', 'Euploea core godartii', '(Lucas, 1853)', 'Bướm quạ chót cánh bạc', 'SPA_01569', 'Cánh màu nâu với các đốm trắng. Điểm dễ dàng nhận diện loài này là mặt trên chót cánh trước màu bạc, dễ thấy khi bay. Chúng có một số dạng. Dạng gặp ở Việt Nam: Mặt trên con đực ở cánh trước có dãy chấm sau đĩa cánh và mép cánh, các chấm này có màu trắng xanh ở vùng chót cánh; ở cánh sau cũng có dãy chấm nhỏ chạy theo mép cánh và một dãy chấm dạng oval sau đĩa cánh. Mặt dưới cánh trước con đực có màu nâu nhạt hơn nhưng ở chót cánh không có ánh xanh, có 2 hoặc 3 chấm ở vùng đĩa cánh, còn có 1 chấm ở vùng chót thuộc trung tâm. Mặt dưới cánh sau có 5 chấm ở vùng đĩa cánh. các đặc điểm khác còn lại giống như ở mặt trên. Bướm cái và bướm đực giống nhau. Sải cánh: 85-95mm. Gặp khắp nơi. Sâu ăn lá nhiều loài cây khác nhau, trong đó có Trúc đào Neurium oleander, họ Trúc đào Apocynaceae, một loại cây cảnh phổ biến và cả vài loại cây cảnh nhập nội cùng họ. Sâu có bốn cặp \"lông\" dài, màu sắc khá khác nhau tuỳ cá thể và khu vực. Do sự phân bố rộng của nơi sinh sống trong đó có những cây thức ăn, loài này xuất hiện hầu như khắp nơi ở vùng thấp bao gồm công viên và vườn trong thành phố. Thường gặp những con bướm bay ở phía Bắc vào mùa xuân, hầu như nhìn thấy rõ khi chúng bay qua những cánh đồng lúa và bãi trống khu vực trồng trọt ở Việt Nam. Bướm cái thường đẻ trứng trên cây Si, Sung thuộc họ Dâu tằm Moraceae; Ngô thi thuộc họ Thiên lý Asclepiadaceae', NULL, 'Phân bố khắp Việt Nam. Phân bố rất rộng từ Ấn Độ đến Thái Lan, từ Đài Loan đến Nam Mianma qua Suntheland đến new Ghine và Úc. ', NULL, NULL, 'Là loài bướm rất phổ biến ở Việt Nam, phổ thức ăn của chúng rất rộng với màu sắc khiêm tốn nên chúng ít bị con người săn đuổi hơn những loài bướm đẹp khác.', NULL, NULL, NULL, 'vncreatures.net'),
(1566, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploeacrameri', 'Euploea crameri', '(Lucus, 1853)', '', 'SPA_01570', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1567, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploeadehaani', 'Euploea dehaani', 'Lucas, 1853', '', 'SPA_01571', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1568, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploeadiocletianus', 'Euploea diocletianus', '(Fabricius, 1793)', '', 'SPA_01572', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1569, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploeadoubledayi', 'Euploea doubledayi', 'C. Felder & R. Felder, 1865', NULL, 'SPA_01573', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1570, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploeaeunice', 'Euploea eunice coelestis', '(Fruhstorfer, 1902)', NULL, 'SPA_01574', 'Cánh trước có màu nâu sẫm với ánh như nhung xanh tím, với một đốm trắng nhỏ ở giữa mép trước, một hàng đốm trắng ở mép ngoài và một hàng đốm xanh tím ở mép phụ. . Có 2 đốm xanh tím phía trên mạch ngang của buồng, mép sau nổi rõ và tròn, ở giữa buồng CU2 có một vết sinh dục dài hơn một chút; 3 đốm phụ, màu trắng xám bóng nơi mép trước chồng lên mép trước và có một vùng màu vàng xám lớn hơn bên dưới màu trắng xám.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan'),
(1571, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploeaeyndhovii', 'Euploea eyndhovii aesatia', '(Fruhstorfer, 1910)', '', 'SPA_01575', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1572, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploeaharrisi', 'Euploea harrisi', 'C. & R. Felder, [1865]', '', 'SPA_01576', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1573, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploeaklugii', 'Euploea klugii erichsonii', '(C. & R. Felder, [1865])', '', 'SPA_01577', 'Cánh trước của con đực có hình dạng khác nhau, đặc biệt là ở đường viền của đầu và lưng . Nó tương đối dài so với chiều rộng của nó, do độ lồi của mép lưng thấp hơn . Các đầu của nó xiên, hơi lồi. Ở giống \` novarae \`, nó rộng, với độ lồi lớn ở rìa lưng khiến nó gần như gần như vuông góc, trong khi các thuật ngữ lồi hơn so với dạng điển hình. Ở nữ giới, sự khác biệt ít rõ ràng hơn', NULL, 'Nó được tìm thấy ở bán đảo Ấn Độ, Sri Lanka và khu vực Mã Lai. Một số dạng hoặc phân loài khác biệt về mặt địa lý đã được đặt tên', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Euploea_klugii'),
(1574, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploeamidamus', 'Euploea midamus chloe', '(Guerrin-Meneville, 1843)', '', 'SPA_01578', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1575, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploeamodesta', 'Euploea modesta modesta', '(Butler, 1866)', '', 'SPA_01579', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1576, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploeamulciber', 'Euploea mulciber mulciber', '(Cramer, [1777])', '', 'SPA_01580', 'Con đực và cái khác nhau. Con đực có mặt trên màu đen, từ đĩa ô cánh trước ra ngoài màu tím óng ánh với các chấm trắng xếp không theo hàng lối, mặt dưới cánh sau có một hàng chấm nhỏ chạy dọc mép ngoài. Con cái có mặt trên cánh trước tương tự con đực, nhưng cánh đốm trắng lớn hơn, cánh sau nền đen có các sọc, vạch trắng hướng vào gốc cánh, viền cánh có một hàng chấm. Dạng sao chép của loài Chilasa paradoxa (họ Bướm phượng Papilionidae) bắt chước con đực của loài này, nhưng kích thước C.paradoxa lớn hơn, cánh trước rất lớn so với cánh sau, chót cánh không tròn bầu như E.mulciber, chót râu cong đặc trưng của họ bướm Phượng, 6 chân dài, khi đậu dễ nhận diện. Sải cánh: 90-100mm. Loài phổ biến, kể cả thành phố, vùng ngoại ô. Rất phổ biến ở ven đường mòn, những chỗ trống trong rừng nhưng số lượng không nhiều như vài loài khác trong cùng giống. Đẻ trứng trên các loài cây có nhựa độc như họ Thiên lý (Asclepiadaceae). Loài này xuất hiện ở một số sinh cảnh với độ cao khác nhau. Bướm cái ít gặp hơn bởi vì chúng thường tập trung trong rừng. Nơi ở của loài E.mulciber cũng giống như nhiều loài bướm đốm khác. Chúng thường hút mật từ những cây thuộc chi Xẻn, Thanh quan và Bông ổi. Có thể gặp loài này vào tất cả thời gian trong năm. Sâu non ăn lá cây Tiền quả (họ Thiên lý) và đôi khi gặp trên cây Trúc đào (họ Trúc đào)', NULL, 'phổ biến ở Việt Nam. Phân bố từ Ấn Độ, phía Đông đến Đài Loan, phía Nam qua Đông Dương và bán đảo Malaysiai đến Sunderland. ', NULL, NULL, 'Tương tự như loài E.core nhưng loài này có màu sắc sặc sỡ và hấp dẫn hơn, nhất là khi chúng bay có màu xanh tím lấp loáng dưới ánh nắng.', NULL, NULL, NULL, 'vncreatures.net'),
(1577, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploearadamanthus', 'Euploea radamanthus radamanthus', '(Fabricius, 1793)', NULL, 'SPA_01581', 'Bướm đực và bướm cái giống nhau. Chúng có thể gặp ở gần thảm rừng thứ sinh, bìa rừng, dọc theo các con đường trong rừng hoặc bên ngoài. Có một số loài thuộc họ bướm Phượng Papilipnidae Chilasa paradoxa và họ bướm giáp Nymphalidae Euripus nyctelius gần giống như loài Euploea radamanthus. Bướm cái đẻ trứng trên một số cây thuộc các họ Thiên lý Asclepiadaceae. Trúc đào Apocynaceae và Dâu tằm Moraceae.', NULL, 'Vùng phân bố của loài Euploea radamanthus từ Asam đến Mianma, Thái Lan, San đa và quần đảo Na tu na. Loài này phổ biến ở khu vực miền Trung và Nam Việt nam. Tên bướm được đặt theo kích thước lớn và màu đen của cánh.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1578, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploeasp', 'Euploea sp.', NULL, NULL, 'SPA_01582', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1579, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploeasylvester', 'Euploea sylvester harissii', ' (C. & R. Felder, [1865])', '', 'SPA_01583', 'Về hình dạng, màu sắc và dấu vết, nó rất giống với lõi Euploea . Tuy nhiên, con đực có thể được phân biệt ngay lập tức bằng sự hiện diện của hai dấu hiệu thay vì một dấu hiệu duy nhất ở phần trước. Trong số những con cái Lionel de Nicéville cho biết, con cái của E. coreta có thể được phân biệt với con cái của E. core bởi những điểm sau: \"Đầu tiên là do đường viền của phần trước nguyên vẹn hơn; ở lõi nó hơi giống hình vỏ sò nhưng có thể nhận thấy được- Thứ hai , bởi mặt dưới của cánh trước có một chuỗi đầy đủ sáu điểm, một điểm nằm giữa mỗi cặp dây thần kinh bên ngoài tế bào; hai dấu vết trên vùng giữa (khoảng giao nhau 1) của cánh trước ở con đực mờ nhạt nhưng khá dễ nhận thấy ở con cái ở cùng một vị trí', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Euploea_sylvester'),
(1580, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Euploea', NULL, 'GEN_0691', 'euploeatulliolus', 'Euploea tulliolus dehaani', '(Lucas, 1853)', '', 'SPA_01584', 'Con đực và con cái giống nhau về kích thước nhưng cũng thuộc loại lưỡng giới và nhỏ hơn các loài bướm khác thuộc giống này. Có màu nâu làm nền. Mặt trên con đực có mép trong cánh trước võng xuống phủ lên 1/3 cánh sau ( khi chúng bay) với những chấm màu loang xanh rộng, một chấm màu xanh ở trung tâm, 3 chấm sau vùng chót của trung tâm ở khoảng 4, 6 và 10 và có một dãy các chấm màu xanh chạy theo sát mép ngoài cánh từ các khoảng 2-7; sát mép trong cánh vùng đĩa cánh có 1 chấm ngang màu xanh; ở con cái mặt trên cánh trước có các đốm xanh xếp đặt giống như ở con đực, nhưng mép trong cánh trước gần như thẳng chứ không võng xuống. Cánh sau con đực và con cái giống nhau và có màu nâu sáng, trên vùng trước từ vùng trung tâm ra mép cánh có vệt rộng màu nâu xám sáng. Mặt dưới: tương tự như ở mặt trên nhưng các chấm màu trắng, dãy các chấm chạy sát mép ngoài cánh không hoàn thiện ở cánh trước. Ở cánh sau: dãy các chấm chạy thep mép cánh ở vùng 1-3 và dãy các chấm sau ô cánh (sát mép cánh) ở vùng 3-7. Sải cánh: 70 - 80mm. Một trong những cây thức ăn của chúng là cây sung thuộc họ Dâu tằm Moraceae. Loài này phân bố ở độ cao dưới 1.200 m. Sống ở các khu rừng thứ sinh, trảng cỏ, bụi cây và các vùng nông nghiệp.', NULL, 'Phân bố khắp Việt Nam.  Phân bố rộng từ Đài Loan và Nam Mianma qua Sunderland đến New Ghine và Australlia, Việt Nam.', NULL, NULL, 'Tuy có phổ phân bố rộng cả trên thế giới và trong nước nhưng tần số gặp loài này thấp. Khi bay chúng cũng có màu sắc đẹp, lấp loáng ánh xanh như E.mulciber và cũng giống với loài này ở chỗ về hình thái con cái và con đực khác nhau. Do đó, chúng rất có ý nghĩa trong phân loại học và đa dạng sinh học.', NULL, NULL, NULL, 'vncreatures.net'),
(1581, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Ideopsis', NULL, 'GEN_0952', 'ideopsissimilis', 'Ideopsis similis persimilis', '(Moore, 1879)', 'Bướm cỏ đốm xanh', 'SPA_01585', 'Bướm có màu nền nâu đen. Mặt trên cánh trước đen, cánh sau nâu - đen dẫn ra mép, có các đốm và vạch màu xanh lơ, mặt dưới tương tự nhưng màu nhạt hơn. Đặc điểm phân biệt hai  Ideopsis similis và Ideopsis vulgaris là các đốm ở cánh trước.Mặt trên cánh trước của loài Ideopsis similis có màu sẫm hơn. Bướm đực và bướm cái giống nhau. Sải cánh: 75-85mm. Thường gặp ở chỗ trống đôi  khi tập trung thành đàn cùng với các loài khác trong họ. Sâu ăn lá những cây có nhựa độc như họ Thiên lý Asclepiadaceae. Có ở những sinh cảnh khác nhau từ nơi có rừng thưa đến thảm thực vật thứ sinh và các vùng đất canh tác, nhìn chung ở độ cao thấp. Tuy nhiên, bướm cái phân bố giới hạn ở nơi có rừng. Giống như nhiều loài bướm Đốm khác ở Việt Nam, loài này hút mật hoa từ những cây thuộc chi Bông ổi Lantana camara, Hồng bì Clausena lansium, Xẻn, Cỏ hôi Ageratum conyzoides và Đại bi.             ', NULL, 'Đây là loài phổ biến khắp nơi ở Việt Nam. Ấn độ, Srilanca, Trung Quốc, Nhật Bản, Thái Lan, Lào, Phi-lip-pin, Việt Nam.', NULL, NULL, 'Loài loài có phổ phân bố rộng trên thế giới và ở Việt Nam và số lượng cá thể của loài trong rừng tự nhiên cũng còn khá phong phú. Tuy nhiên, chúng có bộ cánh cũng khá sặc sỡ mang màu sắc đặc trưng của một số loài trong họ bướm Đốm nên cũng rất hấp dẫn người sưu tầm.', NULL, NULL, NULL, 'vncreatures.net'),
(1582, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Ideopsis', NULL, 'GEN_0952', 'ideopsisvulgaris', 'Ideopsis vulgaris macina', '(Fruhstorfer, 1804)', '', 'SPA_01586', 'Cánh trước màu nâu, sọc xanh nhạt và trong mờ; có 5 sọc cơ bản: 1 bờ ngoài dài của tĩnh mạch thất giữa trên, 2 mép ngoài của tĩnh mạch thất giữa dưới, khớp cơ bản, 1 mép sau ngắn hơn, 1 ngăn trong giống hình que; ở đó là đốm ngang có răng cưa ở cuối khoang giữa, có 3 đốm ở phía ngoài và phía trên của vết ngang, phía trước có 5 vết không đều; vùng thứ hai và thứ ba có các đốm nhọn hơi dài vào trong. mỗi cái; mép ngoài và mép phụ ngoài cùng có 1 cột đốm và đốm. Cánh sau có màu nhạt hơn, và 2 vệt cơ bản nằm ở khoang giữa và được thống nhất ở phần gốc. Các vân cơ bản khác dài ra và các vân bên ngoài tĩnh mạch não thất bao quanh mạc treo, có 1 hàng chấm và chấm ở rìa ngoài và rìa ngoại vi. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(1583, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Parantica', NULL, 'GEN_1457', 'paranticaaglea', 'Parantica aglea melanoides', '(Moore, 1883)', '', 'SPA_01587', 'Loài rất dễ nhận diện. Cánh có màu đen làm nền với các đốm và vạch như trắng làm cho bướm có màu sáng trắng. Mép đỉnh cánh trước đột ngột lượn ngoặt vào phía đĩa cánh ở đoạn 2/5 đường mép ngoài cánh. Đây có lẽ cũng là đặc điểm của hầu hết các loài thuộc họ bướm Đốm nhưng các loài thuộc giống Parantica được nhìn thấy rõ ràng nhất, nét nhất. Đặc biệt các vạch rất rộng ở phần gốc cánh, khiến chỉ còn các đường đen mảnh. Mặt trên và dưới giống nhau. Bướm cái và bướm đực giống nhau. Loài Parantica aspasia có kiểu đốm tương tự Parantica aglea nhưng dễ dàng nhận diện bởi các đốm ở cánh sau và vạch dưới ô cánh trước có màu vàng, đồng thời kích thước nhỏ hơn nhiều. Sải cánh: 75 - 90mm. Thường gặp cùng sinh cảnh với các loài khác trong họ Danaidae. Chúng sống ở những thảm rừng thứ sinh có bóng râm, trong rừng hoặc  chỗ trống ở những độ cao khác nhau. Bướm bay yếu và chậm, thường gặp chúng bay riêng lẻ. Những cây thức ăn là Đầu dài xoan (họ Thiên lý Asclepiadaceae). Cây chủ còn là Tylophora ovata.    ', NULL, 'Loài này rất phổ biến, gặp mọi nơi ở Việt Nam. Khá phổ biến ở mọi nơi, gặp ít hơn ở các khu rừng nguyên sinh và trên đỉnh núi cao. Đông Nam Châu Á, Đài Loan, các đảo Andaman và Nicobar.', NULL, NULL, 'Là loài bướm phổ biến với màu sắc rất nền nã, giản dị và bay chậm nên dễ quan sát và dễ thu bắt. Tuy nhiên, chúng ít hấp dẫn con người hơn các loài bướm đẹp khác và số lượng cá thể của chúng cũng còn phong phú nên loài này chưa cần bảo vệ và hạn chế thu bắt nhưng cũng không nên phá vỡ nơi cư trú của chúng vì đó là những nơi cư trú của cả cộng đồng bướm.', NULL, NULL, NULL, 'Vncreatures'),
(1584, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Parantica', NULL, 'GEN_1457', 'paranticaagleoides', 'Parantica agleoides agleoides', '(C. & R. Felder, 1860)', '', 'SPA_01588', 'có cánh trên màu xám xanh với các đường gân và mép màu đen, trên cánh trước có một đường dài nhạt màu ở khoảng 11 và các đốm màu xám xanh ở trong tế bào được chia bằng các đường dọc màu đen thành 2 hoặc 3 phần. Ở cánh sau, vạch đen trong ô rộng bằng các mảng màu xám xanh ở hai bên. Mặt dưới cánh có hoa văn tương tự nhưng màu nhạt hơn. Bướm đực có các vết ở gần khu vực cận vệ của cánh sau. Ấu trùng của Parantica agleoides có hình trụ, màu tím sẫm, cơ thể được bao phủ bởi một hàng đốm màu trắng ở lưng, lưng bên, bên và xoắn ốc. Ngoài ra còn có các đốm màu vàng chanh ở mặt lưng và hình xoắn ốc. Trên màng ngực có một cặp sừng dài màu đen, ở đốt bụng thứ 8 có một sừng nhô ra ngắn hơn.  Nhộng Parntica agleoides có hình dạng giống cái thùng, màu xanh chanh với sọc ngang màu bạc và một loạt chấm đen ở mặt dưới. Có những đốm bạc rải rác trang trí trên lưng ngực và miếng đệm cánh, hai cặp mảng đen rộng gần lò hỏa táng. có thể được tìm thấy trong rừng mưa nhiệt đới, rừng ngập mặn, khu vực ven biển và công viên.  có khả năng bay chậm, thích môi trường thoáng đãng nhưng có mái che, thường đậu trên cây để tắm nắng. ăn các lá non, mềm của loài Tylophora flexuosa ở tuổi đầu và chuyển sang lá rộng và trưởng thành ở tuổi tiếp theo. Sinh sản bằng cách đẻ trứng (noãn), trứng được đẻ riêng lẻ ở mặt dưới lá non hoặc thân chồi non. Trứng có màu trắng, giống quả bóng bầu dục nhọn, đứng ở một đầu, có sọc ngang nông.', NULL, ' Parantica agleoides có thể được tìm thấy ở Ấn Độ, Myanmar, Indomalaya đến Java.', NULL, NULL, NULL, NULL, NULL, NULL, 'Baliwildlife'),
(1585, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Parantica', NULL, 'GEN_1457', 'paranticaaspasia', 'Parantica aspasia aspasia', '(Fabricius, 1787)', '', 'SPA_01589', ' cánh chủ yếu là màu xám xanh, với các mảng màu đen thông thường của loài Parantica. Mỗi cánh có một mảng cơ bản màu vàng sáng, ở cánh sau che phủ khoảng một nửa bề mặt cánh. Loài bướm này không phải là hiếm và thường lui tới các khu vực có rừng hơn là vùng đất trống. Nó bay chậm và thường lướt trên không trung. Khi nghỉ ngơi, nó treo ngược trên cành khô, thường khép cánh lại.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Butterfly Circle'),
(1586, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Parantica', NULL, 'GEN_1457', 'paranticamelaneus', 'Parantica melaneus', '(Cramer, [1775] )', '', 'SPA_01590', 'Ở cả con đực và con cái, đôi cánh đều thon dài. Mặt trên: cánh trước; màu đen, cánh sau màu nâu sẫm có đốm và vệt màu trắng xanh nhạt. Mặt dưới: cánh trước màu đen với đỉnh có màu nâu hạt dẻ sáng, cánh sau màu nâu hạt dẻ sáng. Đầu và ngực có đốm trắng, bụng màu nâu vàng. Rừng ở độ cao lên tới 3000m', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Indiabiodiversity'),
(1587, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Parantica', NULL, 'GEN_1457', 'paranticasita', 'Parantica sita sita.', '(Kollar, 1844)', NULL, 'SPA_01591', 'Đặc điểm nhận dạng:\n\nRất dễ phát hiện ra chúng vì có kích thước lớn, cánh sau có màu nền nâu đỏ, bụng màu cam đỏ. Về kích thước, màu sắc, nền cánh trước gần như giống hệt cánh trước của loài Parantica swinhoei nhưng cánh sau có nền màu nâu đỏ, hình thù các đốm - dải trắng trên cánh có hơi khác một chút và ở rìa mép ngoài cánh không có các đốm trắng nhỏ mà chỉ có màu nền nâu đỏ đặc trưng. Sải cánh: 90-120mm.\n\nSinh học sinh thái:\n\nLoài này thường tụ tập thành bầy ở những khu vực nhất định trong rừng gần cây ký chủ của sâu non trước khi kết bạn, giao phối. Cây ký chủ làm thức ăn của sâu non là loài Marsdenia roylei.', NULL, 'Kasmia, Ấn Độ, Trung Quốc và Đài Loan, Thái Lan, Malaixia, Lào và Việt Nam Phân bố khá phổ biến ở độ cao trên 700m Ở Vườn quốc gia Tam Đảo, Bidoup – Núi Bà', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1588, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Danaidae', 'Bướm Giáp', 'FAM_116', 'Parantica', NULL, 'GEN_1457', 'paranticaswinhoei', 'Parantica swinhoei szechuana.', '(Fruhstorfer, 1899)', NULL, 'SPA_01592', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1589, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Abraximorpha', NULL, 'GEN_0004', 'abraximorphadavidii', 'Abraximorpha davidii', '(Mabille, 1876) ', NULL, 'SPA_01593', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1590, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Acerbas', NULL, 'GEN_0017', 'acerbasanthea', 'Acerbas anthea', '(Hewitson, 1868)', '', 'SPA_01594', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1591, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Aeromachus', NULL, 'GEN_0043', 'aeromachuspygmaeus', 'Aeromachus pygmaeus', '(Fabricius, 1775)', NULL, 'SPA_01595', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1592, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Ampittia', NULL, 'GEN_0084', 'ampittiadioscorides', 'Ampittia dioscorides etura', '(Mabille, 1891)', NULL, 'SPA_01596', ' Cánh trước màu vàng vàng sáng, đường gân màu đen, mép ngoài có một dải đen rộng đều, hơi phồng lên nhưng vuông vức vào trong ở góc cản, một đường viền đen rộng ở mép cản có hai đốm vàng vàng, một đốm trước một chút ở giữa, cái kia ở xa hơn một chút ở giữa; một dải màu đen chạy từ giữa dải biên cản trở đến bờ một phần ba trước đỉnh, ném ra một dải chéo từ phía trên giữa của nó và nối với biên\n\nban nhạc; trong một số ví dụ, dải diseal này bị ngắt kết nối với costa khỏi xà ngang. Cánh sau màu nâu đen, có hình dạng không đều, ngắn, rộng, có dải màu vàng vàng, gồm các đốm được chia thành các gân, hai đốm ở giữa thon dài, các đốm ở phía dưới nhỏ. Lông mao màu nâu, nhiều chỗ có màu vàng vàng, nhất là ở góc hậu môn. Dưới. Cánh trước như trên, nhưng rìa ngoài cùng ít nhiều có màu vàng vàng. Cánh sau có màu nền vàng vàng, phần lớn cánh phủ vảy nhỏ màu nâu, mảng phân tán như trên, viền có màu nhạt và một loạt các đốm phụ màu nâu nhạt ở mép cánh bao quanh cánh từ gốc đến cánh. góc hậu môn. Ăng-ten màu đen, viền vàng, râu màu vàng ở mặt dưới và ở chóp; lòng bàn tay, đầu và thân màu nâu ở trên, lòng bàn tay và đầu có màu vàng, phía dưới toàn bộ màu vàng.\n\nNữ giới. Mặt trên màu nâu sẫm. Cánh trước có một đốm vàng ở cuối tế bào và xuất hiện một loạt đốm vàng, hai, đôi khi ba, chia theo gân, từ gần gân, một phần sáu tính từ đỉnh, hai ở giữa đĩa trong các khoảng giao nhau ở giữa, và một khoảng nhỏ ở khoảng giữa giữa, một loạt các đốm màu hơi vàng cận biên không rõ ràng ở nửa trên của cánh. Mặt dưới nhạt hơn. Cánh trước có các đốm như trên to hơn, có một vệt phụ màu vàng từ gốc ra ngoài giữa. Cánh sau có nhiều vảy màu vàng nhỏ ở các phần, một loạt các đốm màu hơi vàng hình đĩa và một loạt các đốm ở rìa.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
(1593, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Ancistroides', NULL, 'GEN_0093', 'ancistroidesnigrita', 'Ancistroides nigrita', '(Snellen, 1880)', '', 'SPA_01597', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
