(1596, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Astictopterus', NULL, 'GEN_0175', 'astictopterusjama', 'Astictopterus jama olivascens', '(Moore, 1878)', '', 'SPA_01600', 'Bướm đực và bướm cái giống nhau, bướm cái thường có những đốm ở cánh trước. Bướm có 2 dạng theo mùa. ở dạng mùa mưa, cánh trước có các đốm bị tiêu giảm nhiều. còn mặt dưói cánh sau hầu như không giống nhau. Bướm dạng mùa khô có 2 hoặc 3 đốm trắng thường phát triển gần điểm cuối của cánh trước, còn mặt dưới cánh sau thay đổi với màu hơi đỏ. Chúng xuất hiện gần như quanh năm ở sát bìa rừng, những chỗ trống trải, ở rừng phục hồi thứ sinh hầu như ở nơi thấp. Sâu non sống trên cây  Cỏ chỉ Cynodon dactylon, Chè vè - Miscanthus sinensis, Sậy khô Neyraudia reynaudiana thuộc họ Cỏ Poaceae.', NULL, 'Rất phổ biến ở khắp Việt Nam. Nepal, Đông bắc Ấn Độ và Nam Trung Quốc đến Sumatra và Java.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
