(1644, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Erionota', NULL, 'GEN_0667', 'erionotathrax', 'Erionota thrax', '(Linnaeus, 1767)', '', 'SPA_01648', 'Bướm có chiều dài thân từ 30–35 mm, sải cánh rộng từ 70–80 mm. Toàn thân màu nâu sẫm; đầu và ngực phủ một lớp vảy màu nâu xám. Mắt kép lớn, hình bán cầu. Râu đầu dạng móc câu. Cánh trước màu nâu đậm. Gốc cánh trước, gần cạnh ngoài có một túm lông màu vàng tro. Giữa cánh có hai đốm vàng lớn, gần mép ngoài có một đốm vàng nhỏ, những đốm này có dạng hình chữ nhật. Thời gian sống của bướm khoảng 2 tuần, trong thời gian này một bướm cái đẻ khoảng 200 trứng. Sải cánh dài 70–77 mm. Có nhiều lứa mỗi năm. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'vi.wikipedia.org'),
