(1663, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Hasora', NULL, 'GEN_0826', 'hasoravitta', 'Hasora vitta', '(Butler, 1870)', 'Bướm Nhảy Chấm Trắng Nhỏ ', 'SPA_01667', 'Có chung những đặc điểm cơ bản của giống Hasora. Mặt trên: con đực màu nâu, cánh trước thường có một chấm trắng nhỏ ở khoảng 6 và đôi khi còn ở khoảng 2 và 3. Con cái: có những đốm ở những khoảng 2 và to hơn ở khoảng 3. Mặt dưới: ít nhiều có màu xanh dương - xanh lục ánh láng bóng. Cánh sau có một dải rộng xấp xỉ 2mm màu đỏ tía nhạt hơi nhòe nhoẹt chạy ngang từ mép trên xuống sát thùy cuối cánh. Loài bướm này khác nhau về kích thước và chiều rộng của dải màu trắng ở mặt dưới. Sải cánh: 45-50mm. Bướm xuất hiện quanh năm ở những bãi trống và chỗ cây bị chặt vùng đất thấp, rừng ở độ cao, rừng kín và rừng phục hồi thứ sinh; hoạt động chủ yếu vào hoàng hôn và lúc mặt trời lặn, chúng thường đậu trên mặt lá. Sâu non ăn lá cây thuộc họ Đậu Fabaceae (Thàn mát Millettia nigrescens) và sống trong tổ.    ', NULL, 'Loài này phổ biến mọi nơi ở Việt Nam. Vùng phân bố rộng, từ Ấn Độ và Trung Quốc đến Phi-lip-pin và Tân Ghi-nê, Thái Lan, Lào, Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
