(1677, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Lambrix', NULL, 'GEN_1016', 'lambrixsalsala', 'Lambrix salsala', '(Moore, 1865)', 'Bướm nhảy màu nâu', 'SPA_01681', 'Bướm đực khác nhau theo từng cá thể với những dải màu son đất ở mặt trên cánh trước và các đốm trắng ở mặt dưới cánh sau màu hơi đỏ. Bướm cái giống nhau nhưng có một số đốm trắng nhỏ ở cánh trước thay vào những sọc màu son đất. Có thể gặp bướm bay ở sát bìa rừng, chỗ rừng bị chặt. những đám cỏ, rừng phục hồi thứ sinh, chủ yếu ở nơi thấp. Bướm xuất hiện quanh năm phụ thuộc vào từng vùng. Sâu non sống trên cây Tre và một số cỏ lá Tre.', NULL, 'Loài này gặp khắp nơi ở Việt Nam và còn phân bố từ Nepal và Đông bắc Ấn Độ đến Srilanca, Đông nam Trung Quốc, phía Nam đến Sumatra và Java. Tên loài dịch nghĩa từ tiếng Anh.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.'),
