(1682, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Matapa', NULL, 'GEN_1166', 'matapadruna', 'Matapa druna', '(Moore, [1866])', NULL, 'SPA_01686', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1683, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Matapa', NULL, 'GEN_1166', 'matapasarsivarna', 'Matapa sarsivarna', '(Moore, [1866])', '', 'SPA_01687', 'Có đặc điểm chung của giống Matapa. Loài Matapa sasivarna có màu nâu sậm, ở mặt trên gốc cánh có các vảy dạng lông màu xanh lục. Rìa ngoài cánh sau có viền lông rung màu cam. Vệt giữa mặt dưới cánh trước ở con đực hẹp và vàng nhạt. Loài Matapa cresta rất giống với loài này nhưng phần chót cánh ở mặt trên màu nhạt hơn so với phần còn lại của cánh. Mắt có màu đỏ. Có kích thước gần bằng Matapa aria. Sải cánh: 40-45mm. Đặc điểm chung: Thường gặp trong bóng râm, dưới tán rừng. Hoạt động mạnh lúc gần tối', NULL, 'Phân bố toàn Việt Nam. Đông bắc Ấn Độ, Mianma, Hải Nam, Thái Lan, Lào, Tây Malaixia, Inđônêxia, Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1684, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Mooreana', NULL, 'GEN_1252', 'mooreanatrichoneura', 'Mooreana trichoneura', '(C. & R. Felder, 1860)', '', 'SPA_01688', 'Giống Mooreana có con đực không thường xuyên phồng lên và có túm lông ở đoạn giữa đốt chày thêm vào đó thường xuyên có lông màu chì ở đốt chày chân sau. Trên cánh trước có nhiều chấm sáng trong, có chấm tròn, có chấm kéo dài; trên cánh sau có vùng cuối rộng với màu cam đến màu vàng. Mặt trên màu nâu với các đốm trong suốt thậm chí có đến trên dưới 14 chấm ở cánh trước. Chúng được bài trí ở cuối vùng trung tâm ở các khoảng 2 và 3 và tạo dải đốm vòng cung giữa cánh  màu trắng. Ở cánh sau có một loạt đốm màu nâu tối lan rộng từ mép trên tới mép trong và viền bên ngoài vùng chót và cuối cánh sau là cả một mảng màu vàng rộng. Sải cánh: 40-45mm. Thích sống ở những nơi bằng phẳng trong rừng. Cây thức ăn của loài này thuộc họ Bìm bìm Convolvulaceae và họ Củ nâu Dioscoreaceae.', NULL, ' Phân bố ở độ cao dưới 1.200m, ở các rừng nguyên sinh và rất phổ biến ở các rừng thứ sinh thuộc VQG Tam Đảo, Ba Bể … Bắc Ấn Độ, Mianma, Thái Lan, Lào, Malaixia, NeoMalaixia, Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
