(1691, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Oriens', NULL, 'GEN_1395', 'oriensgola', 'Oriens gola pseudolus', '(Mabille, 1883)', '', 'SPA_01695', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1692, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Oriens', NULL, 'GEN_1395', 'oriensgoloides', 'Oriens goloides', '(Moore, [1881])', '', 'SPA_01696', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1693, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Parnara', NULL, 'GEN_1479', 'parnaraapostata', 'Parnara apostata hulsei', 'Devyatkin & Monastyrskii, 1999', NULL, 'SPA_01697', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1694, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Parnara', NULL, 'GEN_1479', 'parnarabada', 'Parnara bada', '(Moore, 1878)', NULL, 'SPA_01698', 'Thân dày, đầu to, trước mắt có lông mi. Các đầu xúc tu của những con trưởng thành thuộc họ Mối có móc (các đầu có móc), và các gốc của râu cách xa nhau; bàn chân trước của cả nam và nữ trưởng thành đều bình thường. Bay nhanh và nhảy. Giống như loài bướm xám nhỏ, họ bướm có kích thước nhỏ trong số các loài bướm, với cánh trước hình tam giác và cánh sau hình bầu dục. Màu đen sẫm hoặc rám nắng, một số ít loài có màu vàng hoặc trắng . Bề ngoài đơn giản, không lòe loẹt. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(1695, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Parnara', NULL, 'GEN_1479', 'parnaraganga', 'Parnara ganga', '(Evans, 1937)', NULL, 'SPA_01699', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1696, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Parnara', NULL, 'GEN_1479', 'parnaraguttata', 'Parnara guttata', 'Bremer & Grey, 1852', NULL, 'SPA_01700', 'Cơ thể trưởng thành dài 17-19 mm, màu nâu sẫm pha vàng vàng, có 8 đốm trắng mờ ở cánh trước xếp thành vòng cung, 4 đốm trắng ở cánh sau xếp thành một hàng. Sâu non hình trục, màu xanh lục, bên mình có chất tiết màu trắng, có thể quay tơ và gấp lá lúa thành búp, ẩn mình trong đó, ban đêm ăn lá lúa. Chồi nếp có thể ảnh hưởng đến sự nảy mầm của gạo. Nó cũng gây hại cho tre, Hemerocallis, hoa nhài nước, và ăn cỏ tranh. Biện pháp phòng trừ: Diệt bằng lược lúa, diệt bằng kìm, hoặc sử dụng ong ký sinh thiên địch để phòng trừ; cắt bỏ gốc cây lài và dọn sạch cỏ dại trên bờ ruộng để diệt trừ một số ấu trùng đốt cháy. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(1697, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Pelopidas', NULL, 'GEN_1497', 'pelopidasagna', 'Pelopidas agna', '(Moore, 1866)', 'Bướm cuốn lá lớn ', 'SPA_01701', 'Loài Pelopidas.agna có kích thước nhỏ hơn Pelopidas sinensis, có nền màu nâu đôi chỗ hơi sẫm và con đực có mặt trên cánh trước với một vệt tối màu ở giữa ô cánh và kết thúc ở gân 1b, cũng có 8 đốm xếp gần giống loài P.sinensis nhưng ba đốm nhỏ nằm gần mép trên cánh không nằm trên một đường thẳng và không có gạch chéo màu trắng, tất cả các đốm đều rất nhỏ và nhỏ hơn ở loài Pelopidas sinensis nhiều. Cánh sau hầu như không có hoa văn, nhưng vẫn còn có thể xuất hiện một số dấu vết của các đốm. Con cái có tất cả các đốm rõ hơn ở con đực, bao gồm cả một đốm không trong suốt ở khoảng 1b của cánh trước. Mặt dưới: cánh sau con đực có các vảy màu đất son - xanh lục bao phủ, với các đốm nhỏ ở vùng sau giữa ô cánh và một đốm ở vùng trung tâm.  Có thể gặp chúng từ tháng 3 đến tháng 11 ở thung lũng sông, rừng phục hồi thứ sinh, đất trồng trọt, vườn và những bãi trống. Sống ở các vùng nông nghiệp và trảng cây bụi, đến độ cao 1.200m thì hiếm gặp. Chúng hoạt động tích cực vào ban ngày, bay đến cây hoa, đặc biệt là cây Bông ổi. Thức ăn của sâu non cũng là những cây thuộc họ Lúa. Sâu non sống trong tổ bằng những chiếc lá cuốn lại. Bướm, đặc biệt là bướm cái dễ nhầm với các giống khác thuộc giống Pelopidas, Baoris, Caltoris và Bordo.   ', NULL, ' Đây là loài phổ biến ở khắp Việt Nam. Phân bố rộng từ Srilanca tới toàn bộ Ấn Độ qua Đông Dương, quần đảo Suntheland và Salomon, Đông Bắc Australlia. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1698, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Pelopidas', NULL, 'GEN_1497', 'pelopidasconjuncta', 'Pelopidas conjuncta', '(Herrich-Schäffer, 1869)', NULL, 'SPA_01702', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1699, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Pelopidas', NULL, 'GEN_1497', 'pelopidasmathias', 'Pelopidas mathias', 'Fabricius, 1798', NULL, 'SPA_01703', 'Nam giới. Mặt trên màu nâu ô liu: cánh trước có hai đốm nhỏ bán trong suốt màu vàng nhạt ở cuối tế bào, ba đốm trước đỉnh và ở con đực, ba đốm đĩa xiên theo sau là một vệt tuyến ấn tượng mảnh, thẳng có viền sẫm màu: cánh sau có một hoặc hai đốm rất không rõ ràng đốm đĩa nhạt. Con cái có năm đốm hình đĩa ở cánh trước và bốn hoặc năm đốm ở cánh sau. Mặt dưới nhạt màu hơn; dấu hiệu rõ ràng hơn; cánh sau cũng có một điểm ở đầu trên của tế bào.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
