(1712, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Potanthus', NULL, 'GEN_1619', 'potanthusomaha', 'Potanthus omaha', '(Edwards, 1863)', NULL, 'SPA_01716', 'Sải cánh: 20 - 24 mm. Cánh  hơn có màu nâu sẫm ở trên, với các mảng màu vàng cam sáng. Mặt dưới màu đen, có các cánh được đánh dấu như trên. Nửa sườn của cánh trước và cánh sau có nhiều lớp vảy màu vàng.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'nparks.'),
