(1715, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Pseudocoladenia', NULL, 'GEN_1649', 'pseudocoladeniadan', 'Pseudocoladenia dan dhyana', '(Fruhstorfer, 1909)', 'Bướm nhảy nâu hung', 'SPA_01719', 'Bướm cái màu tối hơn với các chấm đốm mờ trên cánh và ở mỗi nơi, bướm khác nhau về kích thước và độ đậm nhạt của cánh. Loài này gặp quanh năm ở bìa rừng và trong thảm thực vật thứ sinh, chủ yếu ở những vùng thấp, hoạt động tích cực vào ban ngày, thường bay đậu trên nhưng cây có hoa. Đặc điểm sinh học chưa được nghiên cứu. ', NULL, 'Bướm gặp khắp nơi ở Việt Nam. từ Nepal, Đông bắc Ấn Độ và Nam Trung Quốc đến Indonesia và Philippin', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
