(1736, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Suastus', NULL, 'GEN_1879', 'suastusminutus', 'Suastus minutus aditia', '(Evans, 1949)', '', 'SPA_01740', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1737, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Tagiades', NULL, 'GEN_1902', 'tagiadescohaerens', 'Tagiades cohaerens cynthia', 'Evans, 1934 ', NULL, 'SPA_01741', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1738, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Tagiades', NULL, 'GEN_1902', 'tagiadesgana', 'Tagiades gana meetana', '(Moore, 1879])', '', 'SPA_01742', 'Bướm đực và bướm cái như nhau. Bướm khác nhau về kích thước và các vệt loang màu xanh trên mặt dưới cánh sau Loài này có thể gặp quanh năm trong các rừng rậm và rừng thứ sinh ở độ cao vừa và thấp. ở Việt Nam cây làm thức ăn cho sâu non tìm thấy thuộc họ Củ nâu ', NULL, 'Gặp khắp nơi ở Việt Nam hu vực phân bố rộng ở vùng Đông Dương từ Ấn Độ đến Malaysia, quần đảo Sanđa và Philippin', NULL, NULL, 'Có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
(1739, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Tagiades', NULL, 'GEN_1902', 'tagiadesjapetus', 'Tagiades japetus ravi', '(Moore, [1886])', '', 'SPA_01743', 'Mặt trên có màu nâu nhạt. Phía trước có ba chấm trắng cận chóp dài ba phút, một trong số chúng, đôi khi là hai chấm, thường không có; một dấu chấm phút ở cuối ô, một dấu chấm khác ở gần đáy của khoảng trống giữa thứ hai và một dấu chấm thứ ba bên dưới nó, ở giữa khoảng trống ở giữa đầu tiên, đôi khi một, đôi khi chỉ có hai trong số chúng, đôi khi tất cả đều thiếu. Cánh sau có các dấu hiệu là một loạt các đốm hình đĩa cong đậm hơn màu nền, thường hoàn toàn không nhìn thấy được. Lông mao cả hai cánh màu nâu. Dưới. Phần trước nhạt hơn phần trên, vùng rìa cánh sau và một mảng vuông rộng ở góc cản nhạt hơn phần còn lại của cánh, các chấm nhỏ như trên. Cánh sau màu trắng xám, vùng ven và rìa ngoài hơi lốm đốm màu nâu; một loạt các đốm hình đĩa màu nâu sẫm cong, các đốm phía dưới thường chỉ là các chấm, thường không nhìn thấy được. Nữ giới. Mặt trên có màu giống con đực, nhưng sắc thái màu thay đổi nhiều hơn ở các ví dụ khác nhau ở giới tính này so với con đực, các chấm phụ ở đỉnh thường lớn hơn (không phải luôn luôn) và thường có số lượng ba; các đốm trên đĩa lớn hơn nhiều, đốm ở cuối tế bào tròn, đốm ngoài gần đáy của khoảng gian giữa thứ hai thường có hình nón, đốm ở dưới là lớn nhất và vuông góc và hai đốm nhỏ nằm giữa nó và rìa cản trở . Cánh sau có một đốm đen mờ ở cuối tế bào và một dãy đĩa, tất cả chúng đều rất không rõ ràng trong nhiều ví dụ. Dưới. Cánh trước có phần nhạt màu hơn mặt trên, các dấu hiệu tương tự. Cánh sau thường có màu xám đậm hơn nhiều, đôi khi có màu xám xanh, có một chấm nhỏ ở cuối ô, trong một số ví dụ là một chuỗi đốm đen hoàn toàn không đều, nhưng rất khác nhau về độ nổi bật của nó và trong nhiều ví dụ không thể hiện rõ hơn nó là ở nam giới; đầu và thân phía trên cùng màu với cánh; lòng bàn tay và thân dưới cùng màu với cánh sau.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
(1740, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Tagiades', NULL, 'GEN_1902', 'tagiadeslavatus', 'Tagiades lavatus', 'Butler, 1879', NULL, 'SPA_01744', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1741, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Tagiades', NULL, 'GEN_1902', 'tagiadeslitigiosa', 'Tagiades litigiosa', '(Moschler, 1878)', '', 'SPA_01745', 'Giống Tagiades có khoảng gần chục loài ở Việt Nam. Kích thước thuộc loại lớn trong họ Bướm nhảy Hesperiidae. Xoè cánh khi đậu. Giống Tagiades tương tự giống Darpa, phân biệt dựa trên vài đặc điểm hình thái. Loài Tagiades litigiosa có bướm đực và cái giống nhau. Chúng khác nhau về kích thước và độ dài của các vết loang đen ở rìa ngoài cánh sau. Cả con đực và cái có các dạng theo mùa dạng mùa khô và mùa mưa, dạng mùa mưa nhìn chung nhỏ và sẫm màu hơn. Sải cánh: 46 - 58mm Là giống bướm bay rất nhanh, khi cảm thấy bị đe doạ nó thường bay một khoảng cách ngắn và đậu vào mặt dưới lá cây. Tuy nhiên, có thể dễ dàng quan sát chúng vào sáng sớm ở các bãi cỏ, cây bụi thấp có hoa, đậu sưởi nắng trên lá hoặc hút mật hoa vào buổi sáng. Loài Tagiades litigiosa thường xuất hiện trong rừng từ tháng 3 đến tháng 11 ở độ cao vừa và thấp, chúng thích chỗ bóng cây và thường đậu dưới mặt lá với đôi cánh trải rộng. Sâu non sống trên cây thuộc họ Củ nâu', NULL, 'Khắp nơi ở Việt Nam Vùng phân bố Srilanca, Ấn Độ, Nam Trung Quốc và bán đảo Malaysia', NULL, NULL, 'Có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
