(1756, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Tractrocera', NULL, 'GEN_1973', 'tractroceraarchias', 'Tractrocera archias quinta', ' (Swinhoe, [1913])', '', 'SPA_01760', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1757, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Udaspes', NULL, 'GEN_2011', 'udaspesfolus', 'Udaspes folus', '(Cramer, 1775).', 'Bướm ma cỏ ', 'SPA_01761', 'Giống Udaspes là một giống có rất ít loài. Về cơ bản gần giống với giống Notocrypta, nhưng khác ở chỗ: có một vùng trắng hoặc một đốm mảng trắng to trên cánh sau. Đặc điểm giới tính cũng giống với Notocrypta. Loài U.folus có mặt trên với cánh trước có những đốm trắng to rải ở vùng trung tâm và các khoảng 1b và 2, các đốm nhỏ hơn ở các khoảng 3-8. Cánh sau với vùng chính giữa rộng lớn và màu trắng. Mặt dưới: có nhiều màu lẫn lộn: trắng - xám và nâu- đỏ. Mặc dù khác nhau về kích thước, loài này dường như khá ổn định về hoa văn trên cánh. Hoa văn này giúp không nhầm lẫn chúng với các loài bướm khác ở Việt Nam. Bướm đực và bướm cái giống nhau Có thể gặp chúng quanh năm với số lượng tương đối ở trong rừng thưa, rừng phục hồi thứ sinh, đất trồng trọt, chúng bị hấp dẫn bởi cây có hoa. Sâu non sống trên cây Ngải tiên, Gừng, Nghệ (họ Gừng) và họ Mã tiền. Phân bố ở độ cao dưới 1.200m, nhiều hơn khi xuống dưới, ở các khu rừng thứ sinh và các trảng cỏ, bụi cây.', NULL, 'Tại VQG Tam Đảo, Vườn quốc gia Ba Vì, Ba Bể … từ Srilanca, Ấn Độ, Nê-pan đến Đông Nam Trung Quốc, phía Nam qua Đông Dương đến các đảo nhỏ hơn thuộc quần đảo San-đa. Loài xuất hiện khắp nơi ở Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1758, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Unkana', NULL, 'GEN_2015', 'unkanaambasa', 'Unkana ambasa attina', '(Hewitson, [1866])', '', 'SPA_01762', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1759, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Zela', NULL, 'GEN_2069', 'zelasmaragdinus', 'Zela smaragdinus', '(H.H.Druce, 1912)', '', 'SPA_01763', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1760, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Zographetus', NULL, 'GEN_2079', 'zographetusdoxus', 'Zographetus doxus', 'Eliot, 1959', NULL, 'SPA_01764', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1761, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Hesperiidae', 'Bướm Nhảy', 'FAM_182', 'Zographetus', NULL, 'GEN_2079', 'zographetussatwa', 'Zographetus satwa', '(de Niceville, [1884])', '', 'SPA_01765', 'Sải cánh: Con đực: 33-35,5 mm Con cái: 39 mm. Mặt trên: màu nâu đen đậm. Cánh trước có hai đốm nhỏ dưới bản đồ, đốm dưới gấp đôi kích thước của đốm trên tròn ở đầu bên ngoài phía dưới của ô, hai đốm giống nhau ở gốc của các khoảng cách giữa, đốm dưới gấp đôi kích thước của điểm trên, tất cả bán trong suốt, trắng đục như keo. Một đốm nhỏ như rỉ nước phía trên nút thần kinh phụ chạm vào giữa của nó. Mép sau với phần giữa đĩa có lông tơ màu xanh lục dài. Lông mao. Mặt dưới: cũng có màu nâu sẫm nhưng đỉnh của cánh trước và rìa ngoài của cánh sau rộng ra có màu tím. Đánh trước với các điểm như trên nhưng thiếu một trong những điểm được đặt để chống lại sự lo lắng của chuyên gia phụ; chi phí ở phía ngoài giữa cánh mang một vệt màu vàng sáng hẹp, rộng nhất ở cuối cánh. Cánh sau với hai phần ba cơ bản cũng có màu vàng tươi, rìa ngoài của vùng màu vàng này rất không đều. Một đốm nâu tròn nhỏ gần giữa ô, một đốm khác ở trên nó và một đốm khác. Không có nhân vật tình dục thứ hai. Thân màu nâu vàng ở dưới; râu màu nâu ở trên có hình khuyên che khuất với màu vàng ở dưới, màu nâu câu lạc bộ. Con cái chỉ khác con đực ở chỗ lớn hơn, cánh rộng hơn và đỉnh của cánh trước ít nhọn hơn. Có một điểm phút thứ hai phía trên điểm lớn trong ô của cánh trước. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(1762, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Acytolepis', NULL, 'GEN_0033', 'acytolepispuspa', 'Acytolepis puspa gisca', '(Fruhstorfer, 1910)', '', 'SPA_01766', 'Mặt dưới: hơi trắng xanh; các vết, một số màu đen, một số sẫm màu, nhưng tất cả đều lớn và rõ ràng. Cánh trước: một vạch ngắn trên các tế bào hình đĩa, một chuỗi bảy đốm cong hướng vào trong, nằm ngang, hình đĩa gồm bảy đốm, ít nhiều thon dài, trong đó đốm ở khoảng giao thoa 2 thẳng đứng và hình sin, đốm tiếp theo phía trên nó có hình bầu dục không đều và đặt xiên, tiếp theo nhỏ hơn và gần như tròn, phần thứ tư được đặt gần như dọc, tạo thành một thanh ngắn, và ba phần đỉnh có kích thước giảm dần so với xương sườn; ngoài những điểm này là một đường mặt trăng nằm ngang bên trong, một loạt các đốm ngang ở phía dưới bên ngoài và một đường lông mi rất mảnh. Cánh sau: hai đốm nền và ba đốm dưới đáy theo thứ tự dọc; một đường trên tế bào đĩa; một điểm phía trên nó tại đáy của khoảng trống 6; một điểm lớn hơn nhiều ở giao điểm 7; một chuỗi năm đốm nằm ngang không đều ở đĩa dưới, tiếp theo là các dấu hiệu ở đầu tương tự như các dấu hiệu ở mặt trước, ngoại trừ các đốm ở hàng dưới cùng được làm tròn chứ không phải nằm ngang. Lông mao của cả hai cánh trước và cánh sau có màu trắng xen kẽ với màu đen sẫm ở đầu gân. Râu, đầu, ngực và bụng màu đen sẫm, râu có vòng màu trắng; phía dưới: lòng bàn tay, ngực và bụng màu trắng', NULL, 'Loài bướm này xuất hiện ở Bán đảo Ấn Độ , Himalaya , Assam , Andamans , Nicobars , Sri Lanka , Campuchia , Myanmar , [4] [8] Đài Loan , Philippines , Borneo , [9] Sulawesi [10] và New Guinea ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Acytolepis_puspa'),
(1763, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Allotinus', NULL, 'GEN_0064', 'allotinusdrumila', 'Allotinus drumila', '(Moore, [1866])', NULL, 'SPA_01767', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1764, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Allotinus', NULL, 'GEN_0064', 'allotinussubstrigosus', 'Allotinus substrigosus substrigosus', '(Moore, 1884)', '', 'SPA_01768', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1765, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Allotinus', NULL, 'GEN_0064', 'allotinusunicolor', 'Allotinus unicolor rekkia', '(Riley & Godfey, 1921)', '', 'SPA_01769', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1766, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Amblypodia', NULL, 'GEN_0076', 'amblypodiaanita', 'Amblypodia anita anita', '(Hewitson, 1862)', '', 'SPA_01770', 'Mặt trên màu tím sẫm, độ bóng rất ít, màu che khuất viền đen ở mép. Cánh trước, cánh và rìa ngoài có dải màu hơi đen rộng vừa phải, thường rộng nhất ở phần sau. Cánh sau có dải sườn rộng, dải rìa ngoài hẹp, ở hầu hết các mẫu vật chỉ là một đường; thùy hậu môn có màu đỏ xỉn. Lông mao màu đen, đuôi mập mạp, có lông mao màu đen. Mặt dưới màu nâu đỏ. Phần trước có một đường màu đen từ gân gần đỉnh đến rìa cản trở ở giữa, tiếp theo là một loạt các vết đen hình mặt trăng không liên kết rõ ràng sau đĩa, không phải lúc nào cũng nhìn thấy được và đôi khi là dấu hiệu của một chuỗi phụ ở rìa. Cánh sau có một đường màu đen cong ra phía trong và một loạt các chấm đen hình đĩa cong ra phía ngoài không rõ ràng được đánh dấu bằng các điểm trắng, cả hai đều nối tiếp hai đường của cánh trước và một loạt các chấm đen tương tự ở rìa phụ, màu nền của cánh cánh có tông màu khác nhau trong các ví dụ khác nhau. Nữ giới. Mặt trên có màu tím rất xỉn, đôi khi gần như màu nâu tím. Cánh trước có viền rộng và viền ngoài màu nâu đen. Cánh sau nhìn chung có màu nâu tím xỉn, không có viền, thùy hậu môn giống như ở con đực. Mặt dưới có các sắc thái màu khác nhau từ xám đất son đến nâu tím, có các vết giống như ở con đực, nhưng một số ví dụ có màu sẫm hơn có một dải các vết màu trắng tràn ngập liên quan đến đường đĩa. Ăng-ten màu đen, có đầu màu cam; đầu và thân trên và dưới cùng màu với cánh.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
