(1771, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Anthene', NULL, 'GEN_0114', 'antheneemolus', 'Anthene emolus', '(Godart, [1824])', 'Bướm lông xanh ', 'SPA_01775', 'Giống Anthene có vài đặc điểm giống với Nacaduba, tuy nhiên râu của chúng dài hơn và mập. Gân 11 và 12 tự do ( không nối với nhau). Lông rung ở cuối cánh sau dài và tạo thành 3 đuôi ngắn ở gân 1,2 và 3.Việt Nam có hai loài trong giống Anthene. Loài A.lycaenina có chót cánh trước và góc ngoài cánh sau nhọn hơn, mép ngoài cánh trước khá thẳng; ở mặt dưới cánh sau, sát bờ cánh, có một chấm đen rất rõ. Còn loài A.emolus có mặt trên con đực xanh tím sậm với nền mép đen, con cái màu nâu với phần gốc cánh màu tím - trên cánh sau con cái có các đốm tối màu ở mép ngoài. Mặt dưới con đực và cái giống nhau, cánh sau có một đốm mắt viền cam ở góc ngoài và một chấm đen ở đáy cánh, gần gốc cánh. Có ba đuôi rất ngắn ở cánh sau, tạo thành từ các lông nhỏ. Có kích thước gần bằng các loài thuộc giống Jamides và Nacadula. Sải cánh ≥ 30mm. Loài A.emolus còn có một dạng khác nữa, về cơ bản rất giống dạng được giới thiệu trên đây, nhưng màu sắc ở mặt trên xanh đậm hơn và các hoa văn ở mặt dưới rõ rệt hơn. Thường gặp ở các vũng nước trong rừng. Hay đậu lên quần áo hoặc da người để hút các chất khoáng trong mồ hôi. Bay rất nhanh nhưng chỉ từng chặng ngắn. Bướm đực có thể thường gặp ở những chỗ đất trũng trên những lối mòn nhỏ trong rừng, ở bờ sông và suối gần rừng phục hồi thứ sinh. Loài này thích vùng đất thấp. Trên bán đảo Malaysia bướm cái đẻ trứng trên cây Vàng anh - Saraca dives họ Đậu Fabaceae, định cư do những loài kiến đặc biệt. Sâu non tuổi nhỏ được kiến tha đến tổ của chúng, ở đó chúng lớn lên, trong khi những sâu non không được kiến tha về tổ sẽ bị chết.        ', NULL, 'Loài này xuất hiện khắp nơi ở Việt Nam. Phân bố từ Ấn Độ qua bán đảo Đông Dương : Thái Lan, Lào, Việt và quần đảo San-đa đến Tân-Ghi-nê và Ôx-trây-li-a.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
