(1787, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Arhopala', NULL, 'GEN_0156', 'arhopalafulla', 'Arhopala fulla', '(Hewitson, 1862)', NULL, 'SPA_01791', 'màu hoa cà, con cái có cánh trước màu xanh đen và cánh sau màu xanh tím với viền đen rất rộng. Loài sosias Fruhst ở đảo Molucca của Obi có màu xám trắng thay vì xám nâu. và ở cánh sau có nhiều chấm trắng rõ rệt hơn)], nhưng trên mặt dưới màu nâu của cánh trước không có bất kỳ dấu vết nào ngoại trừ 2 sọc mờ sẫm hơn song song với mép ở vùng rìa; cũng có các đốm ngang hình đĩa ở cánh sau; ngoại trừ một dấu vết mơ hồ ở loài andamanica W.-Mas. (147 f) có phần nhỏ hơn và ở phần hậu môn của cánh trước nhẹ hơn nhiều, nhưng ở vùng rìa của cánh sau kém sáng hơn nhiều, các sọc mờ bên dưới có. vẫn còn mơ hồ hơn và bản thân loài côn trùng này được cho là nhỏ hơn. subfasciata Mr. bên dưới lại trông giống fulla điển hình hơn , nhưng các sọc trên đĩa của cánh sau không có và các chấm ở rìa chỉ giới hạn ở một vài dấu vết. - babbsi J. & T. (146 B a), từ Shouten Is., không hề có bất kỳ dấu vết nào như vậy; vùng rìa và vùng cơ bản bên dưới gần như có cùng màu, được ngăn cách bởi một bóng tối rộng. - prasiae Fruhst., từ Amboina, có bề mặt trên màu xanh hoa cà đậm hơn so với dạng Andaman và dạng uru, từ đó loài này được mô tả ban đầu, tách biệt với loài fulla điển hình bởi màu xám hơn là màu nâu khói bên dưới; dải sau đĩa rộng của cánh sau có viền màu vàng thay vì màu trắng.', NULL, 'Nó được tìm thấy ở Đông Nam Á (Sikkim tới Indonesia và Philippines)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Arhopala_fulla'),
