(1798, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Athene', NULL, 'GEN_0178', 'atheneemolus', 'Athene emolus', '(Godart, 1823). ', NULL, 'SPA_01802', 'Mặt trên: màu tím xỉn; gốc cánh tràn ngập màu xanh lam; cả hai cánh trước và cánh sau đều có các đường lông tơ màu đen tuyền rõ ràng, ở phần cánh trước hơi mở rộng ở đỉnh. Cánh sau: mép sườn phía trên gân 7 và mép lưng phía dưới gân 1a màu nâu nhạt; các đốm đen không đều, nằm ngang, ở đầu cuối phụ ở các khoảng giao nhau 1 đến 3, các đốm đen ở các khoảng giao nhau 1 và 2 lớn hơn nhiều so với các đốm đen ở khoảng giao thoa 3; vùng đáy sau được bao phủ bởi những sợi lông dài màu nâu tím. Lông mao của cả cánh trước và cánh sau đều có màu nâu. [', NULL, 'là một loài bướm nhỏ được tìm thấy ở Ấn Độ [1] và Đông Nam Á', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Anthene_emolus'),
(1799, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Bindahara', NULL, 'GEN_0223', 'bindaharaphocides', 'Bindahara phocides', '(Fabricius 1793)', NULL, 'SPA_01803', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1800, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Caleta', NULL, 'GEN_0277', 'caletaelna', 'Caleta elna noliteia', '(Fruhstorfer, 1918)', 'Buớm hề vạch gấp khúc ', 'SPA_01804', 'Bướm có kích thước nhỏ, sải cánh: 24-32mm và có thể nhầm lẫn với Discolampa ethion, Caleta roxus hoặc Castalius rosimon. Mặt dưới cánh gồm 2 màu đen và trắng cánh trước có một vệt đen nhìn giống như khuỷu tay bắt đầu từ gốc cánh kéo dài đến gần chóp cánh. Cuối phần gấp khuỷu là một mảng đen. Rìa cánh và chóp cánh trước là những màng đen với những đốm trắng mờ. Gốc cánh sau là một mảng đen lớn nhưng không kéo sát vào gốc cánh. Ở giữa cánh sau là 3 mảng đen lớn gân như đứt khúc, đuôi ngắn. Mặt trên màu đen với vùng giữa cánh màu trắng. Loài côn trùng biến thái hoàn toàn này thường đậu trên mắt đất ở bìa rừng hay gần các vũng nước nhỏ để hút khoáng chất, bay nhanh khi bị động. Cây ký chủ của sâu non là một số loaì thuộc họ Táo ta Rhamnaceae. Gặp nhiều trong rừng hoặc gần rừng. Chúng thường tập trung ở những vũng nước chứa chất khoáng với nhiều loài khác, đôi khi với số lượng lớn. Hiếm gặp. Sống ở độ cao dưới 700m trong các khu rừng thường xanh núi cao còn tốt.', NULL, 'Ở Việt Nam chúng hầu như phân bố ở khắp các tỉnh nhưng chỉ gặp ở các vùng có rừng thường xanh núi cao từ 700m trở lên.  Loài này phân bố ở Ấn Độ, Myanmar, Thái Lan, Lào.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1801, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Caleta', NULL, 'GEN_0277', 'caletaroxus', 'Caleta roxus', '(Godart, [1824])', '', 'SPA_01805', 'Có mặt trên màu đen với một dải trắng xiên ở giữa cánh trước và cánh sau. Dải kéo dài từ gân số 5 phía trên ở mặt trước và mặt sau của cánh sau. Ở phần trước, nó được kéo dài ra phía ngoài một chút so với gân 3, đỉnh của hình vuông mở rộng này. Mặt dưới: màu trắng pha chút vàng nhạt, có các vết đen sau: một dải thẳng, đều, tương đối rộng ngang gốc cánh sau, tiếp tục xiên từ phía trước và ngang qua phần trước đến giữa xương sườn, ở đó nó được nối với nhau bằng một đường viền hẹp ở mép sườn thành một thanh ngang ngắn không đều, phía trên, hình đĩa, xiên ra ngoài, rộng nhất trên mép; phía sau trên đường thẳng với thanh này là một vết hình bầu dục nhỏ, dài ngang, ở khoảng giao nhau 3 và bên dưới en echelon với hai đốm hợp nhất lớn hơn sau, cái này ở trên cái kia, ở khoảng giao nhau 1 và 2; rìa tận cùng có một dải ngang đều, mép trong của nó hơi có rãnh (hình vỏ sò), chạy ngang về phía trong bởi một loạt các đốm trắng tuyến tính nhỏ. Cánh sau: một dải nằm ngang, hình đĩa, rất không đều, ngắt quãng rộng rãi ở giữa; hai đốm hợp nhất nằm ngang qua các khoảng giao nhau 4 và 5, tiếp theo là một loạt các lunus riêng biệt, hoàn chỉnh, ở phần dưới đầu, có viền mảnh ở mặt ngoài với màu trắng và một đường trắng phía trước nổi bật. Lông mao của cả cánh trước và cánh sau đều có màu nâu; đuôi ngắn dạng sợi đến phần sau có màu đen pha chút trắng. Râu, đầu, ngực và bụng màu đen, bụng có vạch trắng ở hai bên', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1802, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Callenya', NULL, 'GEN_0281', 'callenyalenya', 'Callenya lenya', '(Evans, 1932)', NULL, 'SPA_01806', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1803, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Castalius', NULL, 'GEN_0325', 'castaliusrosimon', 'Castalius rosimon rosimon', '(Fabricius, 1775)', '', 'SPA_01807', 'Những cá thể bướm của giống bướm này có những đặc điểm đặc trưng bởi có kích thước nhỏ, màu nền trắng với những vệt đốm màu đen ở mặt trên và rải từ gốc của gân 12 ở mặt dưới của cánh trước. Mặt trên cánh với viền cánh có màu đen bao phủ rộng. Gân 11 và 12 của cánh trước nối với nhau, mắt của chúng nhẵn. Những con trưởng thành rất dễ bắt gặp ở nơi có những cây thức ăn của chúng là Zizyphus, jujuba, phát triển tốt trên những nơi bằng phẳng có những loài cây có hoa nhiều mật ngọt dọc hai bên đường đi. Chúng hay bay ra vào buổi sáng hay chiều muộn. Mặt trên cánh viền đen với các đốm đen, gốc cánh xanh lơ. Mặt dưới trắng, có các đốm đen rải đều. Cánh sau có một đuôi nhỏ, cũng thường gặp những con bị mất đuôi. Con đực lớn hơn con cái và có màu sắc khác nhau. Ở con cái, mặt trên cánh có phần màu đen rộng hơn nhiều và gốc cánh không có màu xanh. Kiểu màu sắc mặt dưới cánh của loài này cũng thấy ở một số loài khác trong cùng họ, nhưng các loài kia thường chỉ gặp nhiều trong rừng. Bướm đực có một đường viền tối màu rộng ở trên mặt trên cánh trước. Sải cánh: 24-35mm. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(1804, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Catochrysops', NULL, 'GEN_0331', 'catochrysopspanormus', 'Catochrysops panormus exiguus', '(Distant, 1886)', '', 'SPA_01808', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1805, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Catochrysops', NULL, 'GEN_0331', 'catochrysopsstrabo', 'Catochrysops strabo', 'Fabricius, 1793', NULL, 'SPA_01809', 'Mặt trên: Màu tím nhạt với một số ánh sáng màu xanh lam, hơi bạc. Cánh trước: một đường sẫm màu mảnh mai. Cánh sau: khoảng cách 1 có một sọc ngang ngắn ở dưới đầu màu nâu viền vào trong màu trắng; khoảng trống 2 có một đốm đen tròn nổi bật, được viền rất mờ ở mặt trong bởi một vết lõm màu xanh lam lan tỏa; các đốm đen ở mặt dưới hiện rõ qua độ trong suốt; một đường mảnh màu đen tuyền phía trước dễ thấy hơn ở phần trước, ở một số mẫu vật có viền vào trong ở các khoảng gian sau có màu trắng; đường này hiện diện ở các khoảng giao nhau 1 và 2 trong tất cả các mẫu vật. Lông mao của cả cánh trước và cánh sau màu trắng chạy ngang về phía trong bởi một đường màu nâu; đuôi màu đen pha trắng', NULL, 'là một loài bướm nhỏ được tìm thấy ở châu Á thuộc họ lycaenids hoặc blues . Loài này được Johan Christian Fabricius mô tả lần đầu tiên vào năm 1793. Nó được tìm thấy ở Sri Lanka , Ấn Độ , [1] từ Sikkim đến Đông Dương và ở Sundaland , Sulawesi và Philippines ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Catochrysops_strabo'),
(1806, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Celastrina', NULL, 'GEN_0336', 'celastrinalavendularis', 'Celastrina lavendularis', '(Moore, 1877)', '', 'SPA_01810', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1807, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Charana', NULL, 'GEN_0366', 'charanamandarina', 'Charana mandarina', '(Hewitson,[1863]).', NULL, 'SPA_01811', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1808, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Cheritra', NULL, 'GEN_0372', 'cheritrafreja', 'Cheritra freja', '(Fabricius, 1793)', '', 'SPA_01812', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1809, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Chilades', NULL, 'GEN_0374', 'chiladeslajus', 'Chilades lajus', '(Stoll, [1780])', NULL, 'SPA_01813', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1810, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Chilades', NULL, 'GEN_0374', 'chiladespandava', 'Chilades pandava', '(Horsfield, [1829])', NULL, 'SPA_01814', 'Mặt trên màu xanh dương, viền đen mảnh, là loài có đuôi mảnh như sợi chỉ, có một đốm đen sát đuôi cánh sau. Con cái màu nhạt hơn, chỉ có gốc cánh còn màu xanh, nhưng có màu xanh da trời với viền đen rộng trên mép cánh trước, các đốm gần mép ngoài cánh sau ở khoảng 2 màu vàng cam. Mặt dưới màu nâu nhạt có các vạch màu sậm hơn, viền trắng và vài đốm đen rất rõ, có một đốm mắt lớn viền cam ở sát đuôi. Các đốm ở cuối cánh sau ở khoảng 1b và 2 màu vàng da cam, các dạng mùa khô có dải băng nhạt màu ở ô cánh thuộc cả cánh trước và cánh sau. Sải cánh: 26-30mm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.'),
(1811, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Curetis', NULL, 'GEN_0511', 'curetisacuta', 'Curetis acuta acuta', 'Moore, 1877', NULL, 'SPA_01815', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1812, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Curetis', NULL, 'GEN_0511', 'curetisbulis', 'Curetis bulis bulis', '(Westwood, [1851])', '', 'SPA_01816', 'Mặt trên của con đực, cánh trước: màu đen mượt, một mảng rộng ở giữa thon dài, màu đỏ cam sẫm, kéo dài từ gốc ra ngoài khoảng 3/4 chiều dài cánh và lấp đầy vùng từ gân 1 đến giữa tế bào; ở một số mẫu vật lan tỏa, lan rộng xuống phía dưới gân 1 gần gốc, nhưng có màu đen sẫm; mép ngoài của mảng đỏ này tròn không đều. Cánh sau: màu nâu đen, một đốm lớn màu đỏ cam phía trên gân 3 đến gần đỉnh, kéo dài vào trong tế bào đến gần gốc cánh và lan tỏa về phía sau bên dưới gân 3, nhưng trong tế bào có lớp phủ dày với vảy đen sẫm và phía sau được tô bóng bằng những sợi lông dài màu nâu, trong một số ánh sáng nhất định có tông màu vàng; phía trên ô kéo dài từ gốc cánh đến mép trong của đốm màu cam là một vệt rộng nổi bật có màu đậm hơn màu đất; nếp bụng màu nâu hồng nhạt. Mặt dưới: màu trắng bạc với những chấm đen nhỏ rải rác. Cánh trước: một loạt các đĩa đệm và phần dưới đầu trong có các vết màu đen hình mặt trăng rất không rõ ràng, tạo thành các dải hội tụ phía trước bị đứt đoạn, tiếp tục kéo dài từ cánh sau đến Tornus; Ngoài những điểm này, trên cả cánh trước và cánh sau, còn có một loạt các chấm đen nhỏ ở phần dưới cánh, ở hầu hết các mẫu vật rất không rõ ràng. Râu, đầu, ngực và bụng màu nâu sẫm; hai bên bụng màu nâu vàng; phía dưới: lòng bàn tay, ngực và bụng màu trắng.', NULL, 'Nó được tìm thấy ở châu Á .', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Curetis_bulis'),
(1813, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Curetis', NULL, 'GEN_0511', 'curetissantana', 'Curetis santana', '(Moore, 1857)', NULL, 'SPA_01817', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1814, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Curetis', NULL, 'GEN_0511', 'curetissaronis', 'Curetis saronis indosinica', '(Fruhstorfer, 1908)', '', 'SPA_01818', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1815, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Deudorix', NULL, 'GEN_0571', 'deudorixepijarbas', 'Deudorix epijarbas', '(Moore, [1858])', '', 'SPA_01819', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1816, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Discolampa', NULL, 'GEN_0591', 'discolampaethion', 'Discolampa ethion ethion', '(Westwood, [1851])', '', 'SPA_01820', 'Rất giống với loài Castalius rosimon. Mặt trên màu đen, vùng giữa cánh màu trắng với những phần màu tím xem giữa vào vùng đen trắng. Mặt dưới là những mảng đen lớn không đều. Loài này thường đậu trên mắt đất ở bìa rừng hay gần các vũng nước nhỏ để hút khoáng chất và thường đậu chung với một số loài bướm khác, bay nhanh khi bị động. Loài này thường sống ở độ cao thấp. Sâu non ăn lá một số loài thực vật thuộc họ Táo ta Rhamnaceae', NULL, 'Loài này phân bố ở Ấn Độ, Myanmar, Thái Lan, Cambodia. Ở Việt Nam chúng hầu như phân bố ở khắp các tỉnh nhưng chỉ gặp ở các vùng có rừng. Tên bướm được dịch từ tên tiếng Anh.', NULL, NULL, 'Là loài phân bố rộng nhưng ít gặp. Cũng là loài bướm đẹp, độc đáo.', NULL, NULL, NULL, NULL),
