(1824, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Heliophorus', NULL, 'GEN_0841', 'heliophorusbrahma', 'Heliophorus brahma', '(Moore, 1857)', NULL, 'SPA_01828', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1825, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Heliophorus', NULL, 'GEN_0841', 'heliophorusepicles', 'Heliophorus epicles', '(Godart, [1824]', '', 'SPA_01829', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1826, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Heliophorus', NULL, 'GEN_0841', 'heliophorusila', 'Heliophorus ila psuedonexus', 'Eliot, 1963', NULL, 'SPA_01830', 'Sải cánh rộng 30 ~ 34mm. Mặt bụng của cánh màu vàng đối với cả con đực và con cái, có những mảng màu đỏ ở gần mép ngoài; bề mặt của cánh màu đen, có những mảng lượn sóng màu đỏ ở gần mép ngoài của cánh dưới, bướm đực có diện tích lớn. có ánh kim loại màu xanh tím ở cánh trên, và con bướm cái có những mảng màu đỏ ở cánh trên.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan'),
(1827, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Heliophorus', NULL, 'GEN_0841', 'heliophorusindicus', 'Heliophorus indicus', '(Fruhstorfer, 1908)', '  ', 'SPA_01831', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1828, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Heliophorus', NULL, 'GEN_0841', 'heliophoruskohimensis', 'Heliophorus kohimensis', '(Tytler, 1912)', NULL, 'SPA_01832', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1829, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Horaga', NULL, 'GEN_0904', 'horagaonyx', 'Horaga onyx onyx', '(Moore, [ 1858])', '', 'SPA_01833', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1830, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Hypolycaena', NULL, 'GEN_0932', 'hypolycaenaamasa', 'Hypolycaena amasa', '(Hewitson, [1865])', '', 'SPA_01834', 'Bướm đực mặt trên cánh trước có màu xanh da trời, mặt sau màu trắng với những viền xanh nhạt. Mặt dưới cánh trước có màu nâu nhạt ở phần chóp cánh và cánh sau màu trắng nhạt. Cánh sau có 4 chiếc đuôi, 2 đuôi trên ngắn hơn hai đuôi dưới, đuôi rất dài màu trắng phủ lông tơ dễ nhần lẩn với loài Cheritra freja. Phía trước 2 chiếc đuôi ngắn có một mảng phình ra điểm bằng đốm màu xanh thẫm. Đốm mắt là một trong những cơ chế tự bảo vệ của họ bướm nà thay vì nhiều động vật ăn côn trùng thường nhầm tưởng đó là cái đầu của một sinh vật lớn hơn và khi bị tấn công chỉ bị rách một phần nhỏ ở cánh và bay thoát Có thể gặp chúng dọc theo những con đường rừng, bìa rừng hoặc những chỗ rừng bị chặt ở khu vực thấp và đồi gò. Bướm đực tụ tập gần nhữag chỗ ẩm ướt trên đường và bờ sông. Bướm đực và bướm cái bị hấp dẫn bởi các bãi phân chim và thú. Tuy nhiên, chưa rõ đặc điểm sinh học của loài bướm phổ biến này.', NULL, 'Loài này phổ biến khắp nơi ở Việt Nam. Phân bố từ Đông bắc Ấn Độ đến Đông Dương, phía Nam qua quần đảo San đa đến Borneo và Java.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1831, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Hypolycaena', NULL, 'GEN_0932', 'hypolycaenaerylus', 'Hypolycaena erylus himavantus', '(Fruhstorfer, [1912])', '', 'SPA_01835', 'Con cái có mặt trên màu nâu đậm trong khi con đực có mặt trên cánh có màu xanh tím than giống như loài Hypolycaena erylus. Tuy nhiên loài  Hypolycaena thecloides có màu nền mặt dưới cánh sáng hơn, vùng mép cánh trước có màu vàng cam rõ hơn, các vạch dưới cánh lớn hơn và các vùng màu cam rộng và rõ hơn so với màu xám của loài Hypolycaena erylus. Mặt dưới cánh trước ở mép cánh con đực là một đường viền màu cam kéo dài từ chót cánh đến gần gốc cánh. Phần rìa cánh là màng màu đậm hơn so với phần cánh phía bên trong với đường viền mầu cam rất rõ ở rìa cánh. Giữa cánh trước và cánh sau có hai viền gần song song màu cam nhạt khá rõ. Gốc cánh sau có 2 đuôi khá dài và một đốm màu đen gần tròn được bao một nửa trong bằng những vảy màu cam', NULL, 'Loài này phân bố ở Java, Nicobars, Burma - Peninsular Malaya, Singapore. Ở Việt Nam loài này đã gặp ở phía Nam ở một số tỉnh miền Đông nam bộ. Tên bướm được đặt theo màu của cánh', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=3&ID=481'),
(1832, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Hypolycaena', NULL, 'GEN_0932', 'hypolycaenaothona', 'Hypolycaena othona matiana', '(Fruhstorfer, [1912])', '', 'SPA_01836', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1833, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Hypolycaena', NULL, 'GEN_0932', 'hypolycaenathecloides', 'Hypolycaena thecloides', '(C. & R. Felder, 1860)', NULL, 'SPA_01837', 'Đặc điểm nhận dạng:\n\nCon cái có mặt trên màu nâu đậm trong khi con đực có mặt trên cánh có màu xanh tím than giống như loài Hypolycaena erylus. Tuy nhiên loài  Hypolycaena thecloides có màu nền mặt dưới cánh sáng hơn, vùng mép cánh trước có màu vàng cam rõ hơn, các vạch dưới cánh lớn hơn và các vùng màu cam rộng và rõ hơn so với màu xám của loài Hypolycaena erylus. Mặt dưới cánh trước ở mép cánh con đực là một đường viền màu cam kéo dài từ chót cánh đến gần gốc cánh. Phần rìa cánh là màng màu đậm hơn so với phần cánh phía bên trong với đường viền mầu cam rất rõ ở rìa cánh. Giữa cánh trước và cánh sau có hai viền gần song song màu cam nhạt khá rõ. Gốc cánh sau có 2 đuôi khá dài và một đốm màu đen gần tròn được bao một nửa trong bằng những vảy màu cam.\nNơi sống, sinh thái:\n\nLoài này thường đậu trên mặt đất ở bìa rừng hay gần các vũng nước nhỏ để hút khoáng chất, bay nhanh khi bị động giống như loài Hypolycaena erylus. Sâu non sống trên cây Long não Cinnamomum camphora thuộc họ Long não Lauraceae và cây Găng Tamilnadia uliginosa thuộc họ Cà phê Rubiacea', NULL, 'Loài này phân bố ở Java, Nicobars, Burma - Peninsular Malaya, Singapore. Ở Việt Nam loài này đã gặp ở phía Nam ở một số tỉnh miền Đông nam bộ. Tên bướm được đặt theo màu của cánh.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.'),
(1834, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Ionolyce', NULL, 'GEN_0967', 'ionolycehelicon', 'Ionolyce helicon merguiana', '(Felder, 1860)', NULL, 'SPA_01838', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1835, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Iraota', NULL, 'GEN_0969', 'iraotatiomoleon', 'Iraota timoleon maecenas', '(Stoll, 1790).', NULL, 'SPA_01839', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1836, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Jamides', NULL, 'GEN_0984', 'jamidesalecto', 'Jamides alecto', '(C. Felder, 1860)', '', 'SPA_01840', 'Các cá thể của loài này thay đổi màu nền và các hoa văn theo mùa. Mặt trên cánh con đực màu trắng xanh; cánh viền đen mảnh; con cái có viền đen mép ngoài cánh rộng hơn và có màu đen rộng đến 1 mm ở chót cánh. Mặt dưới có các sọc trắng nhỏ; góc ngoài cánh sau có hai đốm mắt với viền cam hình trăng khuyết; có một băng ở sau ô cánh trước liên tiếp từ gân 3 đến gân 7. Cánh sau có một đôi đường thẳng màu trắng ở gần gốc, ở những dạng mùa khô các hoa văn màu tối hơn và cùng nhau tạo thành các dải liên tiếp. Con đực có đặc điểm giới tính phụ. Có một đuôi ngắn. Màu nền mặt dưới cánh thay đổi tuỳ theo mùa. Loài Jamides celeno còn có một dạng khác nữa cũng tương tự như dạng vừa mô tả nhưng khác ở chỗ băng ở sau ô cánh trước không liên tiếp từ gân 3 đến gân 7. Sải cánh: 27-40mm. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(1837, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Jamides', NULL, 'GEN_0984', 'jamidesbochus', 'Jamides bochus bochus', '(Stoll, [1782])', '', 'SPA_01841', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1838, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Jamides', NULL, 'GEN_0984', 'jamidescaeruleus', 'Jamides caeruleus caeruleus', '(H.Druce, 1873)', NULL, 'SPA_01842', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1839, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Jamides', NULL, 'GEN_0984', 'jamidesceleno', 'Jamides celeno celeno', '(Cramer, [1775])', '', 'SPA_01843', 'Sải cánh rộng 28 ~ 34mm. Bề mặt cánh của bướm đực có màu xanh nước biển với ánh nhạt, từ cuối cánh trên đến mép ngoài có mép màu nâu sẫm, mép ngoài của cánh dưới có mép mỏng màu nâu sẫm, mép màu nâu sẫm. của bướm cái phát triển hơn bướm đực. Mặt dưới của cánh màu nâu xám nhạt, có các sóng màu nâu xám với viền trắng. Bướm nhỏ màu xám trắng có nếp gấp nhỏ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.'),
