(1841, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Jamides', NULL, 'GEN_0984', 'jamidesmalaccanus', 'Jamides malaccanus', 'Röber, 1886', '  ', 'SPA_01845', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1842, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Jamides', NULL, 'GEN_0984', 'jamidesphilatus', 'Jamides philatus', '(Snellen, 1877)', '  ', 'SPA_01846', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1843, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Jamides', NULL, 'GEN_0984', 'jamidespura', 'Jamides pura pura', '(Moore, 1886)', '', 'SPA_01847', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1844, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Jamides', NULL, 'GEN_0984', 'jamidessp', 'Jamides sp.', NULL, NULL, 'SPA_01848', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1845, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Lampides', NULL, 'GEN_1020', 'lampidesboeticus', 'Lampides boeticus', '(Linnaeus, 1767)', 'Bướm Xanh Tím Dải Trắng Rộng', 'SPA_01849', 'Cánh viền nâu tối mảnh, con cái có viền đen rộng hơn. Các con đực của giống Lampides thể hiện một kiểu vẩy giới tính độc nhất vô nhị, mặt dưới của chúng cũng độc đáo và không giống bất cứ một giống họ hàng gần gũi nào. Loài Lampides boeticus có mặt trên con đực màu đỏ đun ánh tím với hai đốm đen ở cuối cánh sau. Mặt trên con cái màu nâu với vùng gốc cánh màu xanh da trời nhạt. Trên cánh sau có các dải nhạt màu ở sau ô cánh và gần mép cánh. Có một đuôi ngắn. Mặt dưới: Màu nâu nhạt, có dải trắng xuyên qua nửa cuối của các cánh. Ở vùng 1b và 2 của cánh sau có hai đốm vàng bò - da cam ánh kim. Sải cánh: 24-36mm. Đặc điểm chung: Gặp ở bãi cỏ, trảng cỏ trống có nắng và nơi có thảm thực vật tốt. Khi thấy người thường bay một lúc khá lâu mới đậu lại nên khó quan sát. Loài này thường gặp ở vùng làng quê và thành phố, công viên và vườn, trên bờ và bãi sông. Chúng xuất hiện quanh năm ở độ cao khác nhau. Bướm bị hấp dẫn bởi một số cây có hoa. Tại Hồng kông, sâu non thích ăn lá cây Lục lạc và những cây khác thuộc họ Đậu Fabaceae', NULL, 'Việt Nam: gặp nhiều vào tháng 6,7 ở rừng nguyên sinh và thứ sinh liền kề với rừng nguyên sinh ở những khu rừng đất thấp, ở VQG Cúc Phương, Tam Đảo, Ba Vì gặp rất nhiều loài này vào dịp cuối tháng 6 đầu tháng 7 (dương lịch). Loài này còn gặp ở Đồng Nai, Lâ Loài bướm di cư này có phân bố rất rộng từ châu Âu đến châu Phi và châu Á qua San-đơ-lan đến Ôx-trây-li-a và quần đảo Hawai.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1846, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Leptotes', NULL, 'GEN_1063', 'leptotesplinius', 'Leptotes plinius plinius', '(Fabricius, 1793)', '', 'SPA_01850', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1847, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Logania', NULL, 'GEN_1101', 'loganiamormorata', 'Logania mormorata', '(Moore, 1884)', '', 'SPA_01851', 'Loài này thuộc một chi bướm nhỏ với bề mặt dưới có vân cẩm thạch hoặc nhiều màu sắc không đều. Ở Logania marmorata damis, mặt trên của cánh trước có màu xám xanh với đỉnh màu đen. Cánh sau có màu nâu ở con đực nhưng có vệt màu xám ở con cái. Bướm có khả năng bay yếu và thất thường và thường có thể được tìm thấy ở rìa khu bảo tồn thiên nhiên ở những địa phương có bóng râm. Giai đoạn sâu bướm của loài bướm này ăn rệp. Người ta biết rằng con trưởng thành có thói quen ăn chất tiết của rệp và thậm chí đậu trong cụm rệp. Con bướm ở đây đang đậu trên thân cây nơi có một số con kiến. Mặc dù không thấy rõ con rệp nào trong bức ảnh nhưng sự hiện diện của kiến ​​cho thấy một số loài rệp có thể ở gần đó. Những con kiến ​​dường như để con bướm yên và không làm hại nó.', NULL, ' Thái Lan •Malaysia • Singapore', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1848, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Loxura', NULL, 'GEN_1114', 'loxuraatymnus', 'Loxura atymnus continentalis', ' (Fruhstorfer, [1912])', '', 'SPA_01852', 'Ở mặt trên của cánh,  có màu cam phi kim sáng, với vùng đỉnh màu nâu sẫm hoặc đen. ở mặt trên, loài sau có viền màu nâu sẫm ở cả hai cánh và một vệt chéo hẹp màu nâu chạy ngang qua cánh sau. Loài này có thể được tìm thấy trong rừng mưa nhiệt đới nguyên sinh nhưng thường được tìm thấy ở các khu rừng hoặc đồn điền bị xáo trộn hoặc thứ sinh, nơi có thể được nhìn thấy ở những khu vực có nhiều nắng. Nó thường được tìm thấy ở vùng lân cận của làng. Nó có thể được tìm thấy ở độ cao giữa mực nước biển và khoảng 300 mét. Trứng có hình vòm với nhiều vết lõm nông nhỏ và có màu trắng tía. Nó được đặt đơn lẻ ở gốc các chồi non của cây thực phẩm bao gồm Dioscorea ( Dioscoreaceae ), Smilax ( Smilacaceae ) và Solanum ( Solanaceae ).\nSâu bướm có hình con sên, màu xanh ô liu sáng bóng, có các sọc màu trắng dọc theo chiều dài của lưng. Có vết đỏ chảy dọc theo vùng bụng dưới và dọc giữa lưng. Nó ăn các chồi thịt một cách công khai nhưng được ngụy trang cực kỳ tốt.\nGiống như hầu hết các ấu trùng Lycaenidae, nó có tuyến ở ​​lưng, gần đuôi, tiết ra một chất có đường được kiến ​​\"vắt sữa\". Những con kiến, nhờ sự hiện diện của chúng, đổi lại mang lại một mức độ bảo vệ chống lại kẻ săn mồi và các loài ký sinh.\nNhộng được gắn thẳng đứng vào thân của cây thực phẩm và có hình dáng đặc biệt giống với một chồi lá đã mở một phần. Bụng có màu xanh lá cây tươi sáng, với một dải rộng màu nâu cẩm thạch dọc theo lưng, hai bên ngực và xung quanh mép của vỏ cánh. Bướm thường được bắt gặp đơn lẻ, hoặc đậu với đôi cánh hé mở trên tán lá hoặc đậu trên những chiếc lá sát mặt đất. Tôi cũng đã quan sát thấy những con đực hút nước từ những tảng đá ướt ở rìa sông và quan sát chúng thải nước từ hậu môn lên những tảng đá khô để hòa tan khoáng chất, sau đó chúng hấp thụ.\n ', NULL, ' tìm thấy ở Ấn Độ, Sri Lanka, Myanmar, Thái Lan, Việt Nam, Lào, miền nam Trung Quốc, Đài Loan, Philippines, bán đảo Malaysia, Sumatra, Sarawak, Brunei, Sabah, Kalimantan, Java, Sulawesi và Bali.', NULL, NULL, NULL, NULL, NULL, NULL, 'Boutbutterflies'),
(1849, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Lycaenidae', NULL, 'GEN_1122', 'lycaenidaesp', 'Lycaenidae sp.', NULL, NULL, 'SPA_01853', 'Con trưởng thành có kích thước nhỏ, thường dưới 5 cm và có màu sắc rực rỡ, đôi khi có ánh kim loại. Cánh Lycaenidae thường có màu xanh lam hoặc xanh lục. Hơn một nửa số loài bướm này phụ thuộc vào kiến ​​theo một cách nào đó', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Lycaenidae'),
