(1851, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Mahathala', NULL, 'GEN_1152', 'mahathalaameria', 'Mahathala ameria burmana', '(Hewitson, 1862)', NULL, 'SPA_01855', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1852, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Mahathala', NULL, 'GEN_1152', 'mahathalaariadeva', 'Mahathala ariadeva ariadeva', '(Fruhstorfer, 1908)', '', 'SPA_01856', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1853, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Megisba', NULL, 'GEN_1186', 'megisbamalaya', 'Megisba malaya', '(Horsfield, [1828])', '', 'SPA_01857', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1854, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Miletus', NULL, 'GEN_1231', 'miletusancon', 'Miletus ancon', '(Doherty, 1889)', '', 'SPA_01858', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1855, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Miletus', NULL, 'GEN_1231', 'miletusarchilochus', 'Miletus archilochus archilochus', '(Fruhstorfer, 1913)', NULL, 'SPA_01859', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1856, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Miletus', NULL, 'GEN_1231', 'miletuschinensis', 'Miletus chinensis learchus', 'Felder & Felder, [1865]', NULL, 'SPA_01860', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1857, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Miletus', NULL, 'GEN_1231', 'miletusmallus', 'Miletus mallus mallus', '(Fruhstorfer, 1903)', '', 'SPA_01861', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1858, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Myletus', NULL, 'GEN_1271', 'myletusancon', 'Myletus ancon', NULL, NULL, 'SPA_01862', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1859, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Nacaduba', NULL, 'GEN_1284', 'nacadubaangusta', 'Nacaduba angusta', '(H. Druce, [1873])', '', 'SPA_01863', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1860, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Nacaduba', NULL, 'GEN_1284', 'nacadubaberenice', 'Nacaduba berenice', '(Herrich-Schaffer, 1869)', '', 'SPA_01864', 'có thể có nhiều màu sắc khác nhau, từ xanh lá cây đến hồng, có lẽ tùy thuộc vào thức ăn của nó. Nó có một đường tối dọc theo lưng. Nhộng có màu nâu lốm đốm, có mảng trắng nơi cánh phát triển. Trứng được đẻ riêng lẻ trên chồi của cây thực phẩm. Trứng có màu trắng, tròn và dẹt. Nhộng được giữ bằng móc hậu môn và buộc vào lá hoặc hoa. Nó có chiều dài khoảng 1 cm.\nCon đực trưởng thành có màu hoa cà ở mặt trên của cánh. Con cái có màu hoa cà nhưng nhạt dần sang màu xám đen ở rìa cánh và có các hình chữ V màu trắng ở cuối mỗi cánh sau. Cánh sau của cả hai giới đều có đuôi ngắn, con cái có các đốm đen bên cạnh đuôi ở mặt trên của mỗi cánh sau.\nMặt dưới của cánh có màu nâu vàng, có nửa tá vệt trắng và có một hoặc hai đốm đen trên rãnh của mỗi cánh sau. Sải cánh dài khoảng 2 cm.  Nó ăn nụ hoa và chồi non của nhiều loại cây khác nhau. Sâu bướm thường có sự tham gia của những con kiến ​​đen nhỏ thuộc nhiều loài khác nhau', NULL, ' Loài này phân bố ở phần lớn Đông Nam Á, bao gồm: Borneo, Ấn Độ, New Guinea, Singapore, Đài Loan, Thái Lan, và vùng ven biển của Queensland và New South Wales .', NULL, NULL, NULL, NULL, NULL, NULL, 'Butterflyhouse'),
(1861, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Nacaduba', NULL, 'GEN_1284', 'nacadubaberoe', 'Nacaduba beroe gythion', '(Fruhstorfer, 1916)', '', 'SPA_01865', 'Mặt trên của con đực có màu xanh tím đậm. Chúng có góc hậu môn của cánh sau với một vết rách. Cánh sau có hình tam giác hơn, ít cong hơn với góc giữa rìa hậu môn vuông góc với đuôi và cánh sau. Con cái tương tự như con đực nhưng bề mặt trực tràng có màu xanh lam nhạt hơn và có các vệt bạc ở gốc cánh. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Indiabiodiversity'),
(1862, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Nacaduba', NULL, 'GEN_1284', 'nacadubakurava', 'Nacaduba kurava', '(Moore, [1858])', '', 'SPA_01866', 'Những con bướm đực trưởng thành có màu tím ở trên, nhưng những con cái có màu trắng với ánh xanh lam, có viền và viền rộng màu đen . Cả hai giới của bướm trưởng thành đều có một cái đuôi mỏng ở phần đuôi của mỗi cánh sau. Bên dưới, cả hai giới đều có màu xám nhạt, có một mảng trắng dưới mỗi cánh và nhiều đường vòng cung màu trắng và có một đốm đen bên cạnh mỗi đuôi. Bướm có sải cánh khoảng 2,5 cm. Nhộng có màu nâu với những đốm đen. Nó có chiều dài khoảng 1 cm. Nó được hình thành trong một số kẽ hở có mái che hoặc lá chết cuộn tròn. Sâu bướm thường có sự tham gia của kiến. Sâu bướm phát triển chiều dài khoảng 1 cm. Những con sâu bướm này có màu xanh vàng nhạt và có nốt sần, mặc dù màu sắc có vẻ thay đổi tùy theo màu của thức ăn được ăn. Chúng ăn hoa và chồi của nhiều loại cây khác nhau, bao gồm cả các loại cây khác nhau\n\n\n\n Trứng được đẻ từng cái hoặc đôi trên chồi non hoặc hoa của cây thực phẩm. Trứng có màu trắng, thô, tròn và dẹt, đường kính khoảng 0,5 mm.', NULL, ' Loài này xuất hiện ở nhiều chủng tộc trên khắp Đông Nam Á, bao gồm cả Trung Quốc, Ấn Độ, Philippines, Thái Lan, và ở Úc', NULL, NULL, NULL, NULL, NULL, NULL, 'Butterflyhouse'),
(1863, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Nacaduba', NULL, 'GEN_1284', 'nacadubapavana', 'Nacaduba pavana', '(Horsfield, [1828])', '', 'SPA_01867', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1864, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Nacaduba', NULL, 'GEN_1284', 'nacadubasubperusia', 'Nacaduba subperusia', '(Snellen, 1896)', '', 'SPA_01868', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1865, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Neomyrina', NULL, 'GEN_1301', 'neomyrinanivea', 'Neomyrina nivea', '(Godman Salvin, 1878)', '', 'SPA_01869', 'Loài bướm có kích thước lớn trong họ Bướm xanh Lycaenidae. Mắt màu xanh ngọc bích, khi đậu mặt cánh dưới màu trắng với các vạch sậm màu, không đều, chay dọc từ mép cánh trước đến cánh sau. Góc ngoài cánh sau có hai đốm mắt đen, giữa hai đốm mắt này có các vảy màu xanh. Có hai cặp đuôi, cặp đuôi trên rất dài, thẳng, chót đuôi cong dần lên trên, màu trắng, ở giữa có sọc màu đen nhạt và cặp đuôi ngắn năm phía dưới, cong xuống. Mặt trên màu trắng, chót và rìa cánh trước đen ánh xanh ở con đực và con cái không có ánh xanh. Sải cánh 45 - 48mm. Loài này khá phổ biến trong nhiều kiểu rừng khác nhau, thích độ cao trung bình và thấp. Chúng bay khá nhanh, thường gặp ở các khu rừng còn tốt và những nơi trảng trống gần bìa rừng vào mùa mưa. Bướm cái đẻ trứng và thức ăn của sâu non trên các loài thực vật thuộc chi Balanocarpus sp. thuộc họ Dầu Dipterocapaceae phân bố trong vùng có loài này sinh sống. Ngoài ra sâu non còn ký chủ trên một số loài thực vật thuộc họ Dây gối Celastraceae và họ Na Annonaceae.', NULL, 'Ở Việt Nam chỉ gặp từ Nam bộ. Ở các tỉnh miền Đông Nam bộ  Đồng Nai, Bình Phước, Tây Ninh thường gặp một vài cá thể vào mùa mưa và loài này còn gặp phân bố ở Phú Quốc. Loài phân bố rộng từ Ấn Độ, Java đến Thái Lan, Cambodia', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(1866, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Neopithecops', NULL, 'GEN_1304', 'neopithecopszalmora', 'Neopithecops zalmora', '(Butler, [1870])', NULL, 'SPA_01870', 'Mặt trên của cả hai giới có màu nâu tía sẫm; ở con cái hơi nhạt màu hơn trên đĩa cánh trước. Trong hầu hết các mẫu vật, nhưng không phải tất cả, con đực cũng có đĩa cánh trước nhạt màu tương tự. Dưới; trắng. Cánh trước: đỉnh màu nâu sẫm, đỉnh có gân 10, 11 và 12 có một chấm đen nhỏ; không có dấu đĩa, nhưng các tế bào hình đĩa nổi bật với một đường màu nâu ngắn, rất mảnh, mờ; một loạt các lunu mảnh màu nâu nằm ngang, không đều, nằm ngang, tiếp theo là một đường màu nâu ngoằn ngoèo, rất mảnh, nằm ngang, màu nền trắng ở các khoảng trống phía ngoài tâm của một loạt các đốm đen nằm ngang ở phía dướ', NULL, 'là một loài bướm nhỏ được tìm thấy ở Nam Á và Đông Nam Á', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Neopithecops_zalmora'),
(1867, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Niphanda', NULL, 'GEN_1327', 'niphandacymbia', 'Niphanda cymbia', '(de Niceville, 1884)', '', 'SPA_01871', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1868, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Petrelaea', NULL, 'GEN_1510', 'petrelaeadana', 'Petrelaea dana dima', '(Rhe-philippe, 1911)', '', 'SPA_01872', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1869, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Pithecops', NULL, 'GEN_1568', 'pithecopscorvus', 'Pithecops corvus', '(Fruhstorfer, 1919)', NULL, 'SPA_01874', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1870, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Pithecops', NULL, 'GEN_1568', 'pithecopsfulgens', 'Pithecops fulgens', 'Doherty 1889', NULL, 'SPA_01875', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1871, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Poritia', NULL, 'GEN_1613', 'poritiaerycinoides', 'Poritia erycinoides elsiei', '(Evans, 1925)', '', 'SPA_01876', 'Là loài bướm nhỏ, sải cánh dài 26 đến 36 mm. Nửa cơ bản hoặc nhiều hơn của tế bào ở phần trên của cánh trước có màu xanh lam, với các đốm màu xanh lam ở đỉnh và đầu tận. Con cái: Cánh trước phía trên có một mảng hình đĩa màu vàng phía trên vùng màu xanh lam. Vùng màu xanh lam ở cánh sau phía trên nhỏ và giảm dần thành các đốm hình đĩa vuông ở vị trí 3 và 4. Con cái giống với các đốm của loài đá quý thông thường ( P. hewitsoni ) nhưng có các đốm màu vàng ở cánh sau phía trên. Con đực của đá quý màu xanh lam có màu xanh hơn đá quý thông thường có màu xanh lục hơn. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1872, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Poritia', NULL, 'GEN_1613', 'poritiahewitson', 'Poritia hewitson hewitsoni', '(Moore, [1866])', '', 'SPA_01877', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1873, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Prosotas', NULL, 'GEN_1636', 'prosotasaluta', 'Prosotas aluta', '(H. Druce, 1873)', '', 'SPA_01878', 'Mặt trên của con đực: tỏa sáng màu xanh lam với ánh đỏ tía trong một số ánh sáng nhất định. Cánh trước và cánh sau: termen có viền hẹp với màu đen huyền, trên đó có thể nhìn thấy rõ đường lông tơ màu đen tuyền trên mỗi cánh, viền màu đen huyền hơi mở rộng về phía trước. Mặt dưới: màu nâu sẫm. Cánh trước: một dải ngang, dưới đáy, rộng, sẫm màu, nâu đen, viền trắng từ dưới sườn đến tĩnh mạch 1, một dải tương tự dọc theo các tế bào đĩa cũng kéo dài đến tĩnh mạch 1, một dải tương tự đĩa đệm phía trên từ xương sườn, cong ra ngoài một chút và dừng lại ở gân số 3, tiếp theo là một loạt các đốm đen nằm ngang sau đĩa đệm, ở mặt trong tương đối rộng, mặt ngoài có viền rất mảnh màu trắng; tiếp theo là một loạt các đốm tuyến tính nằm ngang ở phần dưới cực kỳ mảnh, một vạch trắng và một vạch trước lông đen tuyền; lông mao màu nâu. Cánh sau: ba đốm đen nâu sẫm xếp ngang; các dải dưới nền và đĩa đệm ngang có màu tương tự nhau, cả hai dải có viền trong và ngoài với những đường mảnh màu trắng và dải đĩa đệm mở rộng rất nhiều và không đều ở giữa, trong đó chồng lên trên nền tối là một vết ngang màu trắng như tuyết; xa hơn nữa là một loạt các lunus trắng tương đối rộng ở phía sau đĩa đệm, một đường mặt trăng trắng rất mảnh ở phía dưới, một sợi trắng ở cuối và một đường lông mi mảnh mai màu đen tuyền; lông mao óng ả màu nâu mượt; đuôi màu nâu pha chút trắng. Ăng-ten màu đen, trục có lốm đốm màu trắng; đầu đen; ngực và bụng hơi xanh; phía dưới: lòng bàn tay có viền màu đen, ngực và bụng màu trắng', NULL, 'được tìm thấy ở Châu Á.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Prosotas_aluta'),
(1874, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Prosotas', NULL, 'GEN_1636', 'prosotasdubiosa', 'Prosotas dubiosa', '(Semper, 1879)', 'Lineblue nhỏ màu tím', 'SPA_01879', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1875, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Prosotas', NULL, 'GEN_1636', 'prosotaslutea', 'Prosotas lutea', '(Martin, 1895)', '', 'SPA_01880', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1876, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Prosotas', NULL, 'GEN_1636', 'prosotasnora', 'Prosotas nora ardates', ' (Moore, [1873])', '', 'SPA_01881', 'Mặt trên của con đực: màu nâu tía hoặc màu tía với tông màu sẫm, một số mẫu có màu nâu với ánh tía rất nhẹ chỉ nhìn thấy trong một số ánh sáng nhất định. Cánh trước và cánh sau: gần như đồng nhất, cả hai đều có các đường lông mi mảnh màu đen, cánh sau và các mép sườn và lưng nhạt màu hơn; ở hầu hết các mẫu vật có đốm đen ở phần dưới của khoảng trống 2, đôi khi chỉ được nhìn thấy bằng độ trong suốt từ mặt dưới; đuôi màu đen pha trắng. Mặt dưới: màu nâu, xám xịt, nâu nhạt hoặc nâu xỉn.  Cánh trước: một cặp sọc ngang màu trắng ở dưới đáy, một cặp ngắn hơn dọc theo tế bào đĩa và một cặp hình đĩa; tất cả các sọc này đều có viền hẹp ở mặt trong của mỗi cặp với lớp lông tơlàm cho các dải ngang trông hơi đậm hơn màu nềnCánh sau: có các cặp sọc ngang màu trắng, có viền lông ở phía trong tương tự như ở cánh trước, nhưng thậm chí còn không đều và gãy hơn; cặp dưới đáy kéo dài từ gân đến gân 1, phía dưới vùng lưng có màu trắng, cặp tế bào đĩa kéo dài từ xương sườn và liên kết ở phía sau với cặp đĩa đệm không đều và bị trật khớp như ở cánh trước; các dấu hiệu ở đầu cuối tương tự như ở phần trước, nhưng có một loạt các đốm đen ở dưới đầu kép có hình mặt trăng hơn và một đốm tròn màu đen nổi bật ở dưới đầu có đỉnh màu vàng ở khoảng trống 2. Mặt trên của con cái: màu nâu tím, đôi khi có mùi hôi. Cánh trước và cánh sau: giống như ở con đực với các đường sẫm màu phía trước, nhưng khác nhau như sau: Cánh trước: có màu xanh óng ánh từ gốc ra ngoài đến đĩa; cánh sau; một đường màu trắng mảnh, ít nhiều nổi bật viền đường màu đen trước lông ở mặt trong, một đốm đen kép hình đôi (theo cặp) ở đầu cuối phụ ở khoảng trống 1 và một đốm đơn lớn hơn tương tự ở khoảng trống 2. Mặt dưới: màu nền nhạt hơn và sáng hơn ở khoảng trống ở nam giới, các dấu hiệu tương tự nhưng gọn gàng hơn và thường được xác định rõ ràng hơn; cả cánh trước và cánh sau ở hầu hết các mẫu vật đều có một đường cuối màu trắng trước đường sẫm màu trước. Râu, đầu, ngực và bụng giống như ở nam giới ', NULL, ' Bán đảo Ấn Độ từ dãy Himalaya bên ngoài đến Travancore , tránh các vùng sa mạc; Sri Lanka ; Assam ; Miến Điện ; Campuchia ; Tenasserim ; người Andaman và Nicobar ; mở rộng sang tiểu vùng Mã Lai và tới Philippines ', NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
(1877, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Prosotas', NULL, 'GEN_1636', 'prosotasnoreia', 'Prosotas noreia', '(R. Felder, 1868)', NULL, 'SPA_01882', 'Mặt trên của con đực có màu nâu nhạt pha chút tím sáng. Cánh trước và cánh sau: màu tím bóng không kéo dài đến mặt lưng của cánh sau cũng như đến mép sườn và đầu cuối của một trong hai cánh, tất cả đều có viền hẹp với màu nâu nhạt của mặt đất, ngoài ra dọc theo đầu của cả hai cánh là đường trước mảnh mai. Cilia nhạt, gốc màu nâu. Mặt dưới: màu nâu xỉn. Cánh trước: hai đường ngắn hơi hình răng cưa (hình vỏ sò) nằm ngang ở giữa tế bào và hai đường tương tự dọc theo các tế bào hình đĩa, tiếp theo là một đường ngang, không đều, có dây xích (giống như chuỗi), dải đĩa đệm hơi đậm hơn màu nền và có viền vào trong. bên ngoài bằng những đường trắng mảnh; dấu hiệu ở đầu cuối: một đường ở dưới cùng của các đốm tương tự hơi đậm hơn màu nền và được viền bằng các đường màu trắng; nửa sau cơ bản của cánh bên dưới tế bào nguyên vẹn; cuối cùng là một đường màu nâu sẫm phía trước. Cánh sau: các đường ngang màu trắng mảnh, hơi có hình răng cưa, giữa mỗi cặp có màu nền đậm hơn một chút: một cặp xiên ở gốc, một cặp dọc theo các tế bào đĩa và một cặp đĩa hình sin rất không đều, cặp cuối cùng bị trật ở tĩnh mạch 6 , phần sau cong và lệch ra ngoài; theo sau là một loạt các lunus hình mũi tên bên trong và bên ngoài và một đường sẫm màu phía trước, đường cuối cùng này có viền màu trắng bên trong rất mảnh; cuối cùng, một điểm khối phút gần đầu mối trong không gian giao điểm 1a; một điểm tương tự khác ở không gian 1 và một điểm đen tròn lớn hơn rất nhiều ở không gian 2; tất cả những điểm này đều có màu trắng ở mặt trong. Ăng-ten màu đen, trục lốm đốm màu trắng; đầu, ngực và bụng màu nâu nhạt, trên ngực và bụng có màu nâu nhạt; phía dưới: lòng bàn tay, ngực và bụng màu trắng nâu sẫm', NULL, 'Nam Á và Java . ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Prosotas_noreia'),
