(1892, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Spalgis', NULL, 'GEN_1836', 'spalgisepius', 'Spalgis epius epius', '(Westwood, [1851])', '', 'SPA_01897', 'Con đực :Mặt trên: màu nâu xỉn, hơi sẫm hơn về phía đỉnh cánh trước; cũng có một đốm trắng hình vuông ít nhiều nằm ngoài đỉnh của tế bào trên cùng một cánh; ở một số mẫu vật, điểm này hơi khuếch tán. Mặt dưới: nhợt nhạt, mượt, màu trắng nâu; cánh trước và cánh sau có nhiều sọc vằn màu nâu sẫm, rất mảnh, ngắn, hình sin, nằm ngang, có viền ngoài mảnh mai với màu trắng nâu nhạt hơn màu nền; cả hai cánh đều có một đường màu nâu sẫm phía trước và có viền giống nhau ở mặt trong. Ngoài ra, cánh trước có một đốm trắng hình bầu dục ngoài tế bào. Lông mao của cả cánh trước và cánh sau có cùng màu với màu nền của cánh. Ăng-ten, đầu, ngực và bụng màu nâu nhạt, chỏm râu có màu vàng nhạt ở đỉnh; phía dưới: lòng bàn tay và ngực màu xám nâu, bụng màu nâu nhạt\nCon cái: Mặt trên: màu nâu nhạt hơn một chút. Cánh trước: tế bào và đỉnh sẫm màu hơn; một đốm trắng tương tự như ở con đực nhưng lớn hơn, nằm ngoài đỉnh tế bào; trong hầu hết các mẫu vật mở rộng lan tỏa ra ngoài và xuống dưới. Cánh sau: giống cánh đực. Mặt dưới: giống hệt như ở nam giới.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
(1893, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Spindasis', NULL, 'GEN_1846', 'spindasislohita', 'Spindasis lohita batina', '(Fruhstorfer, [1912])', '', 'SPA_01898', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1894, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Spindasis', NULL, 'GEN_1846', 'spindasissyama', 'Spindasis syama latipicta', '(Fruhstorfer, [1912])', '', 'SPA_01899', 'Mặt dưới cánh không thể nhầm lẫn, có màu nền vàng nhạt với các vạch nâu sậm, ở giữa là đường bạc mảnh như sợi chỉ. Một vệt sát gốc ở mặt dưới cánh trước có dạng dùi cui. Dải băng gồm các đốm không liền nhau ở mặt dưới cánh sau kết thúc ở gân 1b và không tiếp tục dọc theo gân này. Mặt trên màu nâu sậm ở con đực, nâu tối ở con cái, với các vệt đen mờ loang lổ. Góc ngoài cánh sau có một đốm màu cam lớn.\nBướm đực và bướm cái giống nhau nhưng bướm đực có cánh lườn tròn hơn, với các vạch nâu sẫm. Góc ngoài cánh sau của mặt dưới cánh có một đốm màu cam khá rõ và lớn. Loài này rất giống với Spindasis lohita và chỉ phân biệt chúng ở gốc mặt dưới cánh sau Spindasis syama có vạch nâu đứt quãng và Spindasis lohita nối liền.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1895, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Suasa', NULL, 'GEN_1878', 'suasalisides', 'Suasa lisides madaura', 'Fruhstorfer, 1912', NULL, 'SPA_01900', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
