(1898, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Syntarucus', NULL, 'GEN_1895', 'syntarucusplinius', 'Syntarucus plinius', '(Fabricius, 1793)', NULL, 'SPA_01903', 'màu tím sẫm, trong một số ánh sáng nhất định, có màu xanh đậm. Cánh trước: không có đốm đen dạng đĩa dễ thấy như ở T. theophrastus ; rìa cuối có viền hẹp màu đen huyền, rộng nhất ở đỉnh, giảm dần đến hình xoắn, tiếp theo là một đường màu đen tuyền phía trước không dễ thấy. Cánh sau: mép sườn hơi nhạt nhưng có màu bóng mờ rộng rãi, tiếp tục như một đường đen mảnh phía trước lông tơ đến hình xoắn ốc. Mặt dưới: màu trắng. Cánh trước: có các mảng màu nâu đen sau: một viền không đều dọc theo sườn đến gần đỉnh, từ đó kéo dài xuống dưới một dải dưới đáy, mở rộng khắp tế bào và bên dưới nó; một dải không đều kéo dài dọc theo các tế bào đĩa và bên dưới chúng đến khoảng giao nhau 1 nơi nó kết thúc tại một điểm; một dải đĩa đệm phía trên có chiều rộng đều hơn nhưng bị trật khớp bên dưới gân 4, phần dưới của nó dịch chuyển vào trong tạo thành một đốm vuông lớn trong khoảng giao nhau 3, bên dưới gân 3 dải được tiếp tục đi xuống bởi hai điểm nhỏ khó thấy, ngoài đây là một dải rất dấu phẩy hình dấu phẩy nhọn ngắn; một đường mặt trăng hoàn chỉnh, cong đều, rất đều đặn, một loạt các đốm nằm ngang ở phần dưới và một đường mảnh phía trước lông mi. Gần gốc cánh kéo dài xiên lên trên và hướng ra ngoài từ mặt lưng có một dấu hình tam giác, viền màu trắng còn lại gần gốc tạo thành một góc nhọn phía trên đỉnh của dấu này; giữa dải đi qua giữa tế bào và dải tế bào ngang là một đường mảnh, không đều, có màu tương tự nhau; và giữa các dải tế bào đĩa và đĩa đệm phía trên, một đường khác ngắn hơn nhiều, kéo dài từ xương sườn xuống nhưng không đến tĩnh mạch 4, đường này hơi hình xương đòn ở phía trước và phía sau', NULL, 'Sri Lanka , Ấn Độ [1] tới Úc ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Leptotes_plinius'),
