(1911, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Yasoda', NULL, 'GEN_2060', 'yasodaandroconifera', 'Yasoda androconifera', 'Fruhstorfer, 1912', NULL, 'SPA_01917', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1912, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Yasoda', NULL, 'GEN_2060', 'yasodatripunctata', 'Yasoda tripuncata', 'Hewitson, 1863', 'Bướm màu cam', 'SPA_01918', 'Đặc điểm nhận dạng:\n\nYasoda là một giống có quan hệ mật thiết với Loxura về môi trường, nơi sống và không có gân 9 trên cánh trước. Các con đực của Yasoda cũng thể hiện đặc tính thứ 2 về giới, đa số chúng có những vẩy đặc trưng dọc gân 1b ở mặt trên của cánh sau. Loài Yasoda tripunctata có mặt trên: màu cam nhạt với viền nâu ở cánh trước và viền hẹp ở cánh sau; ở cánh sau có ba đốm nhỏ giữa ô cánh và dạng mùa mưa thì có thêm một dải màu đen. Mặt dưới: Màu đất son với các điểm trang trí mờ tối đi. Gần giống với loài Loxura atymnus nhưng đuôi dài hơn. Rìa cánh trước cong, mặt dưới cánh sậm màu, gần như nâu, với các hoa văn rõ rệt. Loài này còn có một dạng thứ hai nữa là có màu tối hơn dạng trên; viền mép đen rộng hơn - Trên cánh sau cũng có ba đốm nhỏ như dạng trên và có một dải băng dày chạy tới tận mép ngoài cánh. Sải cánh: 32 - 40 mm.\n\nSinh học, sinh thái:\n\nĐa số sống dọc theo các khoảng rừng có độ cao trung bình và là loài không phổ biến. Bướm đực nhỏ hơn bướm cái. Chúng thường sống trong các khu rừng nguyên sinh và rừng thứ sinh và bay nhanh, xa nên rất khó tiếp cận. Thường sống ở độ cao dưới 800 - 1.200m.', NULL, 'Trong nước: Ninh Bình (Cúc Phương), Huế (Nam Động, Hương Thủy, Phong Điền), Đắc Nông, Darklak, Kontum, Bình Thuận, Lâm Đồng, Khánh Hòa và Phú Quốc.\n\nNước ngoài: Bắc Ấn Độ, phía trên của Mianma tới đồi Karen và Bắc Thái Lan, Lào, Malaysia.', NULL, NULL, 'Là loài có phổ phân bố không rộng, nhưng không thường gặp.', NULL, NULL, NULL, 'vncreatures'),
(1913, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Lycaenidae', 'Bướm Xanh', 'FAM_225', 'Zeltus', NULL, 'GEN_2070', 'zeltusamasa', 'Zeltus amasa', '(Hewitson, 1868)', '', 'SPA_01919', 'Đặc điểm nhận dạng:\n\nBướm đực mặt trên cánh trước có màu xanh da trời, mặt sau màu trắng với những viền xanh nhạt. Mặt dưới cánh trước có màu nâu nhạt ở phần chóp cánh và cánh sau màu trắng nhạt. Cánh sau có 4 chiếc đuôi, 2 đuôi trên ngắn hơn hai đuôi dưới, đuôi rất dài màu trắng phủ lông tơ. Phía trước 2 chiếc đuôi ngắn có một mảng phình ra điểm bằng đốm màu xanh thẫm. Đốm mắt là một trong những cơ chế tự bảo vệ của họ bướm nà thay vì nhiều động vật ăn côn trùng thường nhầm tưởng đó là cái đầu của một sinh vật lớn hơn và khi bị tấn công chỉ bị rách một phần nhỏ ở cánh và bay thoát\n\nSinh học, sinh thái:\n\nCó thể gặp chúng dọc theo những con đường rừng, bìa rừng hoặc những chỗ rừng bị chặt ở khu vực thấp và đồi gò. Bướm đực tụ tập gần nhữag chỗ ẩm ướt trên đường và bờ sông. Cả bướm đực và cái bị hấp dẫn bởi các bãi phân chim và thú. Tuy nhiên, chưa rõ đặc điểm sinh học của loài bướm phổ biến này.', NULL, 'Phân bố từ Đông bắc Ấn Độ đến Đông Dương, phía Nam qua quần đảo San đa đến Bomeo và Java. Loài này phổ biến khắp nơi ở Việt Nam. Tên bướm được đặt theo mầu sắc của cánh.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
