(1927, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Acraea', NULL, 'GEN_0025', 'acraeaissoria', 'Acraea issoria', '(Hübner, 1819).', 'Bướm Kim Vàng ', 'SPA_01933', 'Họ Acraeidae chỉ có một giống Aeraea và 2 loài ở Việt Nam. Loài Aeraea issoria có cánh hẹp và thon dài, bườm đực và bướm cái giống nhau. Mặt trên màu vàng với viền đen và đường đen chạy zic zắc theo mép ngoài cánh  và  các gân chạy dọc rất nổi ở mặt trên cánh, các vạch màu đen ở cuối vùng trung tâm. Trang trí ở con cái tối hơn và rộng hơn, toàn bộ cánh trước có thể được phủ bằng các vẩy đen. Sải cánh: 70 – 80 mm. Ưa sống ở nơi bìa rừng, dọc lối đi, nơi có nhiều ánh sáng mặt trời, quang đãng, bay chậm trong các khu rừng thứ sinh. Loài hiếm. Phân bố ở độ cao dưới 1.200m, trong các khu rừng thứ sinh, trảng cây bụi cỏ và khu nông nghiệp.Thức ăn của sâu non là loài Bọ chó Buddleja thuộc họ Bọ chó Buddlejaceae và Boehmeria salicifolia.', NULL, 'Việt Nam thường gặp ở các tỉnh phía Bắc cho đến Lâm Đồng. Ấn Độ tới Trung Quốc, Mianma, Thái Lan, Lào', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1928, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Acraea', NULL, 'GEN_0025', 'acraeaviolae', 'Acraea violae', '(Fabricius,            ', 'Bướm Nhãn Lồng Đỏ ', 'SPA_01934', 'Họ bướm ngọc Acraeidae chỉ có một giống Acraea và 2 loài ở Việt Nam. Loài Acraea violae có mặt trên màu cam hung đỏ với các chấm đen, nhiều chấm dính vào nhau, viền cánh sau màu đen tuyền với các chấm màu cam ở giữa trông rất đẹp. Các chấm đen nhỏ phân bố đều ở phần trung tâm và ô cánh sau. Con cái màu xỉn và to hơn con đực. Mẫu hoa văn trên cánh của bướm đực và cái giống nhau, bướm cái lớn hơn một chút. Loài thứ hai là Acraea issoria, dễ dàng phân biệt nhờ kích thước lớn hơn, trên cánh không có các chấm đen, cánh trước chỉ có các đốm màu xám, màu nền nhạt hơn. Sải cánh ngắn hơn loài Acraea issoria. Là loài ưa sáng, thường gặp ở trảng trống, nơi có cây bụi thấp, bãi cỏ. Bay chậm, xuất hiện nhiều thành từng đợt, tuỳ thời điểm nở của nhộng. Đẻ trứng thành từng đám trên dây nhãn lồng Passilora foetida, họ Lạc tiên Passifloraceae. Sâu non sống thành đàn, gần hoá nhộng tách ra sống riêng. Chúng bay rất gần mặt đất. Loài này có thể gặp theo mùa ở rừng thứ sinh với độ cao thấp.', NULL, 'phổ biến ở Việt Nam. từ Srilanca và Ấn Độ đến Mianma, Thái Lan và Đông Dương.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1929, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Amathusia', NULL, 'GEN_0070', 'amathusiaphidippus', 'Amathusia phidippus', '(Linnaeus, 1763)', 'Bướm chúa hại cọ dầu ', 'SPA_01935', 'Loài bướm có kích thước lớn, sải cánh từ 100 – 125mm, Mặt cánh trên có màu nâu chocolate đậm và có các dải nâu nhạt ở cả hai mép cánh. Mặt cánh dưới có màu nâu nhạt với các sọc màu nâu đậm, nhạt không đồng nhất. Cánh sau có hai đốm mắt khá lớn rất đặc trưng cho giống Bướm chúa Amathusia sp. Phần gốc cánh sau có một phần kéo dài thành đuôi ngắn. Phần chót đuôi có màu nâu đậm và có 2 đốm mắt hình bán nguyệt ở cả mặt trên lẫn mặt dưới. Là loài bướm ngày nhưng chúng thường xuất hiện và kiếm ăn vào chập tối và ban đêm. Bay chậm và ngắn, ban ngày thường đậu dọc theo thân cây. Do có tập tính bị thu hút bởi ánh sáng nhà nên có thể gặp ở trong nhà̀. Thức ăn của chúng là những loài quả thối trong khu vực phân bố. Sâu non ký chủ trên các loài thực vật thuộc họ Cau Arecaceae', NULL, 'Đồng Nai, Bình Dương và thành phố Hồ Chí Minh.  ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1930, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Amathuxidia', NULL, 'GEN_0071', 'amathuxidiaamythaon', 'Amathuxidia amythaon', '(Talbot, 1932)', '', 'SPA_01936', 'Mặt trên con đực: Màu nền cánh là màu nâu sẫm ở cánh trước và cánh sau, cánh trước có một vùng màu xanh lam rất lờn nằm ở phần giữa cánh. Cánh sau có thuỳ ngắn gần tròn với đốm mắt rất rõ. Mặt dưới cánh có màu nâu sáng và những sọc màu nâu thẫm, cánh sau có 2 đốm mắt to gần tròn, giữa đốm mắt màu trắng. Con cái  nhỏ hơn con đực. Mặt trên con cái: màu nền cánh là màu nâu sẫm ở cả cánh trước và cánh sau, rìa mép cánh có màu nâu nhạt. cánh trước có một vùng màu trắng lớn và những đốm trắng không đều xung quanh. Mặt dưới cánh có màu nâu sáng và một sọc màu nâu thẫm nằm ở giữa chia đều hai bên.', NULL, 'Việt Nam: chúng phần bố ở hầu khắp các tỉnh phía Nam như Lâm Đồng, Đồng Nai, Tây Ninh, Bình Phước, Bà Rịa – Vũng Tàu …', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=3&ID=407'),
(1931, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Argyreus', NULL, 'GEN_0155', 'argyreushyperbius', 'Argyreus hyperbius', '(Linnaeus, 1763)', 'Bướm Thầu Dầu Lông Mượt ', 'SPA_01937', 'Các thành viên giống này có cánh trước bị cắt cụt tạo thành góc ở gân 6. Đồng thời gân cận mép trên cánh trước hoặc gân 12 bị phồng lên ở gốc. Giống Argyreus có màu cam,cam sậm với các đường mảnh màu nâu chạy ngoằn ngoèo trên cánh, mép cánh gợn sóng, chót cánh trước hơi nhô ra thành góc. Mép cánh sau lượn sóng theo đúng nhịp bước sóng của các đường mảnh nâu tối chạy ngoằn ngoèo trên cánh. Mặt dưới cánh sậm màu hơn mặt trên và thường có màu kiểu sắt gỉ. Việt nam có ba loài, Argyreus specularia không có chấm trắng ở trên chót cánh trước, mép cánh ít gợn sóng hơn so với loài Argyreus ariadne. Loài Argyreus merioe có chấm trắng ở chót cánh trước nhưng các đường ngoằn ngoèo ở mặt trên cánh chạy gắt hơn, mép cánh không gợn sóng như Argyreus aridane. Con cái thuộc giống Argyreus có màu nhạt hơn con đực. Vẻ bề ngoài thì bướm đực và cái giống nhau nhưng bướm đực có các mảng vảy phấn tối màu ở mặt dưới cánh trước và mặt trên cánh sau. Ở mặt trên loài Argyreus ariadne có màu nền nâu đất son với 5 hoặc 6 đường ngang hẹp lượn sóng, kéo dài từ mép trên đến mép dưới ở cả 2 cánh. Có một chấm trắng ở gần chót cánh trước. Mặt dưới có màu nâu tối phớt hồng. Sải cánh: 45-55mm. Gặp ở những chỗ có nắng, ven rừng thứ sinh thấp, đặc biệt khu vực gần cây chủ là Thầu dầu Ricinus communis - họ Thầu dầu Euphorbiaceae, một loại cây dại phổ biến khắp nơi. Khi đậu thường xoè cánh. Các loài trong giống  này bay không nhanh. Cách bay khá dễ nhận diện là đập cánh vài lần liên tục sau đó xoè cánh ra để lượn. Cách bay này tương tự giống Neptis. Giống Argyreus thuộc dạng khó tiếp cận. Thông thường, khi phát hiện ra người tới gần nó lập tức bay ra xa, đậu cách vài mét. Bướm thường bay ở khu vực gần chỗ có người ở và khu vực đất trống, ở nơi có mọc cây thức ăn cho sâu non như Thầu dầu Euphorbiaceae.', NULL, ' Phân bố từ Ấn Độ đến Trung Quốc, Nam đến Thái Lan, Lào, Malaixia, Inđônêxia, Việt Nam ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1932, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Ariadne', NULL, 'GEN_0157', 'ariadneariadne', 'Ariadne ariadne pallidor', '(Fruhstorfer, 1899)', '', 'SPA_01938', 'Con bướm này có màu nâu cam với những đường lượn sóng chạy ngang. Phần rìa hơi gợn sóng và có vẻ bị cắt cụt ở đỉnh của cánh trước. Rìa lượn sóng với một góc lớn hiện diện trên khoảng gian vân thứ năm và ở đầu của gân thứ ba. Tornus có góc cạnh rộng rãi. Các thuật ngữ cánh sau có hình vỏ sò sâu. Có một đốm trắng nổi bật ở phía trên của cánh trước. Lông mao có màu trắng xen kẽ với màu nâu. Ở mặt dưới có nhiều màu nâu hơn.\n\nRâu, đầu, ngực và bụng có màu hung đỏ . Con đực có một loạt vảy sáng màu sẫm ( androconia ) trên gân dưới sườn, gân 6 và 7 và một mảng ở mặt dưới của cánh trước về phía gốc. Con cái trông tương tự nhưng hơi nhạt màu hơn và thiếu vảy androconial. [3] [4]\n\nAriadne ariadne có nhiều điểm giống với Ariadne merione , loại thầu dầu thông thường, nhưng ở loại thầu dầu có góc cạnh, các dải hạt dẻ ngang hẹp hơn và ít khuếch tán hơn. Các mép của bánh thầu dầu thông thường ít gợn sóng hơn.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
