trống, ở nơi có mọc cây thức ăn cho sâu non như Thầu dầu.', NULL, 'ở Việt Nam có mọi nơi Ấn Độ đến Trung Quốc, Nam đến Thái Lan, Lào, Malaixia, Inđônêxia, Việt Nam', NULL, NULL, 'Là loài gặp phổ biến và phân bố rộng trên Thế giới và ở Việt Nam.', NULL, NULL, NULL, 'vncreatures.net'),
(1934, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Ariadne', NULL, 'GEN_0157', 'ariadnespecularia', 'Ariadne specularia arca', '(Fruhstorfer, 1906)', '', 'SPA_01940', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1935, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Athyma', NULL, 'GEN_0181', 'athymaasura', 'Athyma asura', 'Moore, 1858', 'Bướm Xích Trắng Nhân Đen ', 'SPA_01941', 'Giống Athyma trước kia còn có tên khác là Parathyma. Athyma có kiểu màu sắc tương tự giống Neptis, nền đen với các đốm trắng xếp thành băng ở mặt trên cánh, mặt dưới thường có màu nâu, nâu đỏ với các đốm, băng trắng tương ứng với mặt trên. Tuy nhiên chúng có những đặc điểm cấu tạo cơ thể khác biệt rõ rệt so với giống Neptis: cánh rộng hơn; râu khá dài so với thân, chắc và thẳng; thân mập chắc. Khối cơ vận động cánh rất phát triển khiến cho phần ngực của loài này lớn. Với đặc điểm cấu tạo như vậy, các loài trong giống này có thể bay rất nhanh, cách bay khác hẳn giống Neptis, cánh đập nhanh và gắt. Con cái của các loài trong giống Athyma rất hiếm gặp. Mặt trên loài A.asura màu nâu tối. Dải trung tâm cánh trước hẹp với những đốm trắng tách biệt ở phía xa vùng trung tâm cánh, có một đốm ở vùng giữa gần mép ngoài ở khoảng 3. Cánh sau có các đốm trắng ở vùng giữa gần mép ngoài, mỗi đốm này có hoặc không có một đốm nhỏ màu đen trong nó trông giống cái xích chó. Loài Athyma asura rất dễ phân biệt với các loài khác trong giống Athyma và các loài khác cùng họ Nymphalidae nhờ có đặc điểm này. Mặt dưới: màu nâu đỏ nhạt; mặt dưới cánh trước cũng có những chấm trắng nhân đen như ở cánh sau và trang trí giống như mặt trên. Sải cánh: 60 - 70mm. Sống ở vùng nhiệt đới và cận nhiệt đới. Giống Athyma thuộc nhóm bướm khá cảnh giác. Khi người quan sát tiến gần khoảng 3-4 mét, nó thường bay ra xa rồi lại đậu xuống. Người quan sát đến gần lần nữa, nó lại bay ra xa. Chu kỳ này có thể lặp đi lặp lại rất lâu trước khi tiếp cận gần được con bướm. Khi thực sự hốt hoảng, nó bay rất nhanh và thường mất hút. Các loài trong giống Athyma sống đơn lẻ, thường chỉ gặp một vài cá thể bay từng chặng ngắn sát mặt đất, dọc đường mòn trong rừng để tìm hút chất khoáng. A.perius là loài duy nhất thường gặp ở dạng sinh cảnh cây bụi, rừng thứ sinh, khu vực đô thị. Phần lớn các loài khác chỉ gặp trong rừng tối. Sâu giống Athyma được ghi nhận đẻ trứng trên một số loài cây thuộc họ Thầu dầu Euphorbiaceae như giống cây Sóc Glochidion sp., Chùm ruột Phyllanthus acidus, hoặc họ Cà phê Rubiaceae như giống cây Bướm bạc Mussaenda sp..    ', NULL, 'Phân bố rộng rãi trên toàn Việt Nam. Bắc Ấn Độ, Mianma, Thái Lan, Lào, Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1936, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Athyma', NULL, 'GEN_0181', 'athymacama', 'Athyma cama camasa', '(Fruhstorfer, 1906)', NULL, 'SPA_01942', 'Đặc điểm nhận dạng:\n\nGiống Athyma trước kia còn có tên khác là Parathyma. Athyma có kiểu màu sắc tương tự giống Neptis, nền đen với các đốm trắng xếp thành băng ở mặt trên cánh, mặt dưới thường có màu nâu, nâu đỏ với các đốm, băng trắng tương ứng với mặt trên. Tuy nhiên chúng có những đặc điểm cấu tạo cơ thể khác biệt rõ rệt so với giống Neptis: cánh rộng hơn; râu khá dài so với thân, chắc và thẳng; thân mập chắc. Khối cơ vận động cánh rất phát triển khiến cho phần ngực của loài này lớn. Với đặc điểm cấu tạo như vậy, các loài trong giống này có thể bay rất nhanh, cách bay khác hẳn giống Neptis, cánh đập nhanh và gắt. Con cái của các loài trong giống Athyma rất hiếm gặp. Mặt trên loài A.asura màu nâu tối. Dải trung tâm cánh trước hẹp với những đốm trắng tách biệt ở phía xa vùng trung tâm cánh, có một đốm ở vùng giữa gần mép ngoài ở khoảng 3. Cánh sau có các đốm trắng ở vùng giữa gần mép ngoài, mỗi đốm này có hoặc không có một đốm nhỏ màu đen trong nó trông giống cái xích chó.\n\nLoài này có dáng dấp màu sắc và hoa văn khác hẳn các loài thuộc giống Neptis. Mặt trên: con đực có màu nền đen với vệt trung tâm cánh trước màu cam, nhưng mờ, có đốm màu cam ở góc trên cánh; dải giữa gần mép ngoài cánh sau rất mờ nhạt. Các dải đốm còn lại ở mặt trên các cánh đều to và có màu trắng sáng. Con cái: màu nâu tối đen với những điểm trang trí màu cam sáng rực, vệt vùng trung tâm cánh trước màu cam sáng,phần trang trí ở giữa gần mép ngoài cánh ở khoảng 4 nhỏ hơn ở khoảng 5. Tất cả các dải, chấm trên con cái đều màu cam vàng sáng to, rộng và rực rỡ; con cái lớn hơn con đực. Mặt dưới: màu vàng đất son với những điểm trang trí nổi bật màu trắng và xanh tím.Sải cánh: 55 -70 mm.\n\nSinh học sinh thái:\n\nSống ở vùng nhiệt đới và cận nhiệt đới. Giống Athyma thuộc nhóm bướm khá cảnh giác. Khi người quan sát tiến gần khoảng 3-4 mét, nó thường bay ra xa rồi lại đậu xuống. Người quan sát đến gần lần nữa, nó lại bay ra xa. Chu kỳ này có thể lặp đi lặp lại rất lâu trước khi tiếp cận gần được con bướm. Khi thực sự hốt hoảng, nó bay rất nhanh và thường mất hút. Các loài trong giống Athyma sống đơn lẻ, thường chỉ gặp một vài cá thể bay từng chặng ngắn sát mặt đất, dọc đường mòn trong rừng để tìm hút chất khoáng. A.perius là loài duy nhất thường gặp ở dạng sinh cảnh cây bụi, rừng thứ sinh, khu vực đô thị. Phần lớn các loài khác chỉ gặp trong rừng tối. Sâu giống Athyma được ghi nhận đẻ trứng trên một số loài cây thuộc họ Thầu dầu Euphorbiaceae như giống cây Sóc Glochidion acuminatum, G. lanceolatum, G. philippicum, G. zeylanicum, G. rubrum, Chùm ruột Phyllanthus acidus, hoặc họ Cà phê Rubiaceae như giống cây Bướm bạc Mussaenda.', NULL, 'Loài này khá phổ biến ở Việt Nam gần như tìm thấy khắp vùng từ Tam Đảo cho đến Đồng Nai ở các khu rừng còn tốt và Bắc Ấn Độ, Mianma, Thái Lan, Lào, Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1937, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Athyma', NULL, 'GEN_0181', 'athymakanwa', 'Athyma kanwa phorkys', ' (Fruhstorfer, 1912)', '', 'SPA_01943', ' Ở trên, Trung sĩ Dot-Dash có màu từ nâu sẫm đến đen với một mảng vảy màu trắng, dát và cong gián đoạn chạy từ giữa xương sườn ở cánh trước đến gần gốc lưng ở cánh sau. Ở mặt trước, vết sau đĩa màu trắng ở không gian 2 gần như hình bầu dục và tách biệt rõ ràng với điểm ở không gian 1b. Thông thường không có điểm sau đĩa đệm ở không gian 3.Vệt tế bào ở cánh trước là toàn bộ và tách biệt khỏi điểm hình tam giác phía sau. Có những đường viền màu trắng ở dưới mép xen kẽ với các vảy sẫm màu trên cả hai cánh, ở cánh sau có dạng một dải rộng chạy từ đỉnh đến lưng. Mặt dưới có màu nâu xám với các vết giống như mặt trên.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'butterflycircle'),
(1938, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Athyma', NULL, 'GEN_0181', 'athymalarymna', 'Athyma larymna siamensis', '(Fruhstorfer,1906)', '', 'SPA_01944', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1939, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Athyma', NULL, 'GEN_0181', 'athymanefte', 'Athyma nefte', '(Cramer, 1780)', 'Bướm Cải Trắng Chóp Cam ', 'SPA_01945', 'Mặt trên: con đực có vệt trung tâm cánh trước chia thành hai khúc rõ hoặc không rõ ràng,có hoặc không có những đốm ở phần giữa gần mép ngoài cánh, ở phía đỉnh màu đất son, nhưng dạng mùa mưa thì không có đốm này; con cái khác biệt với con đực có thể lưỡng hình hoặc không, với màu nâu cam, hoặc nâu socola, hoặc giống như con cái của Athyma cama, nhưng tất cả những khoảng trang trí như mặt trên  và có những đốm đen ở khu vực giữa gần mép ngoài cánh ở khoảng 4 và 5 là như nhau. Gần giống với Athyma cama về cách bài trí hoa văn và kích thước, có một điểm giống nữa là ở vùng đỉnh chót mặt trên cánh trước có một mảng màu đất son hay có thể gọi là cam đỏ, và các đường mảnh chạy theo đường mép ngoài cánh màu nâu vàng mờ. Tất cả các dải và đốm to, nhỏ khác ở mặt trên các cánh đều là màu trắng toát được bài trí nổi bật trên màu nền đen. Hoa văn và cách bài trí ở mặt trên con cái giống hệt như ở loài A.cama nhưng khác vì tất cả màu cam đỏ trên nền đen rất nổi trội, rực rỡ. \n\nMặt dưới có màu nền vàng đất son, hoa văn tương tự mặt trên, thêm vào đó là một loạt các đốm đen ở phần giữa cánh sau và ngoài ra ở góc chót cánh trước có màu đỏ lửa; các dải, chấm to nhỏ còn lại đều màu trắng. Sải cánh: 60 -70mm. Thức ăn của sâu non là một số loài thực vật thuộc họ Thầu dầu Euphorbiaceae như Glochidion zeylancicum hoặc Mussaenda frondosa thuộc họ Cà phê Rubiaceae', NULL, 'Loài này phổ biến khắp các cánh rừng ở Việt Nam. Vùng phân bố từ Cambodia và Thái Lan và lục địa Đông nam châu Á.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1940, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Athyma', NULL, 'GEN_0181', 'athymaopalina', 'Athyma opalina', '(Kollar, 1844)', 'Bướm sọc trắng vạch đỏ', 'SPA_01946', 'Đặc điểm nhận dạng:\n\nGiống Athyma có kiểu màu sắc tương tự giống Neptis, nền đen với các đốm trắng xếp thành băng ở mặt trên cánh, mặt dưới thường có màu nâu, nâu đỏ với các đốm, băng trắng tương ứng với mặt trên. Tuy nhiên chúng có những đặc điểm cấu tạo cơ thể khác biệt rõ rệt so với giống Neptis: cánh rộng hơn; râu khá dài so với thân, chắc và thẳng; thân mập chắc. Khối cơ vận động cánh rất phát triển khiến cho phần ngực của loài này lớn. Với đặc điểm cấu tạo như vậy, các loài trong giống này có thể bay rất nhanh, cách bay khác hẳn giống Neptis, cánh đập nhanh và gắt.\n\nAthyma selenophora, một loài cũng rất phổ biến trong rừng, khá dễ nhận diện với một băng trắng rộng chạy từ giữa cánh trước đến cánh sau con đực và con cái có số hoa văn và cách bài trí ở mặt trên cánh rất khác nhau. Gần chót cánh trước có vài đốm trắng. Trong vùng trung tâm và ô cánh trước có một vạch đỏ, đôi khi đứt đoạn. Mặt dưới con đực có màu nâu đất son hoặc nâu ánh tím lục cùng với các hoa văn nổi bật, màu trắng là chính với một ít chấm đen mờ chạy dọc theo các dải trắng. Con cái của loài Athyma selenophora không hề có màu cam, có các hàng đốm màu trắng ngà rõ nét và có vạch trong ô cánh trước tạo thành các đốm hơi dứt đoạn cũng màu trắng, các đốm hơi tách ra, kích thước lớn hơn. Con cái của các loài trong giống Athyma rất hiếm gặp và thường có các hoa văn và cách bài trí ở mặt trên khác hẳn so với con đực. Sải cánh: 60 - 70mm.\n\nSinh học sinh thái:\n\nGiống Athyma thuộc nhóm bướm khá cảnh giác. Khi người quan sát tiến gần khoảng 3-4 mét, nó thường bay ra xa rồi lại đậu xuống. Người quan sát đến gần lần nữa, nó lại bay ra xa. Chu kỳ này có thể lặp đi lặp lại rất lâu trước khi tiếp cận được gần con bướm. Khi thực sự hốt hoảng, nó bay rất nhanh và thường mất hút. Các loài trong giống Athyma sống đơn lẻ, thường chỉ gặp một vài cá thể bay từng chặng ngắn sát mặt đất, dọc đường mòn trong rừng để tìm hút chất khoáng. Athyma perius là loài duy nhất thường gặp ở dạng sinh cảnh cây bụi, rừng thứ sinh, khu vực đô thị. Phần lớn các loài khác chỉ gặp trong rừng tốt. Sâu giống Athyma được ghi nhận đẻ trứng trên một số loài cây thuộc họ Thầu dầu Euphorbiaceae như giống cây Sóc Glochidion sp., Chùm ruột - Phyllanthus acidus., hoặc họ Cà phê Rubiaceae như giống cây Bướm bạc Mussaenda pubescens. Cây thức ăn của loài Athyma selenophora còn là Adina pilulifera, Adina cordifolia, Mussaend pubescens.', NULL, 'Ấn Độ, Mianma, Trung Quốc, Thái Lan, Lào, Malaixia, Inđônêxia, Việt Nam. Phân bố rộng rãi trên toàn Việt Nam.', NULL, NULL, 'Có phổ phân bố rộng nhưng không thường gặp. Đây là một trong những loài bướm Giáp có thân hình khỏe và đẹp. Cần bảo vệ tốt rừng nguyên sinh nơi chúng ưa thích sống nhất. Có thể nhân nuôi loài này trong trang trại.', NULL, NULL, NULL, 'vncreatures.'),
(1941, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Athyma', NULL, 'GEN_0181', 'athymaperius', 'Athyma perius', '(Linnaeus, 1758)            ', 'Bướm bụng sọc trắng', 'SPA_01947', 'Loài có kích thước trung bình, cơ thể lớn hơn và mập hơn. Bụng bướm đực thường có vạch màu trắng. Bướm cái giống như bướm đực. Loài này có thể dễ dàng phân biệt với các loài khác thuộc giống Athyma như Athyma selenophora hay Athyma nefte do ở các đốt có những vệt trắng trên bụng. Loài A.perius có dải trung tâm xuất phát từ gốc cánh và chia làm 4: đoạn gốc dài, nhỏ, nhọn, tiếp theo về phía chót cánh là 3 chấm to đần đều. Tất cả các dải chấm đều có màu trắng toát nổi bật trên nền đen, ngoại trừ những hình trăng khuyết rất mờ chạy theo gần mép cánh có màu vàng cam. Đây là một nét đặc biệt của loài này và khác hẳn với các loài thuộc giống Neptis. Sải cánh: 60-65mm Là loài khá phổ biến ở rừng phục hồi thứ sinh, ở bìa rừng và gần các sông suối ở độ cao vừa phải và thấp. Bướm bị hấp dẫn bởi một số cây có hoa. Chúng xuất hiện quanh năm và bướm cái đẻ trứng trên một số cây thuộc chi Bọt ếch', NULL, 'Phân bố khắp Việt Nam ở độ cao dưới 1.200m trên các trảng cỏ, bụi cây Phân bố từ Ấn Độ đến Trung Quốc, Đông Dương và Đài Loan, phía Nam đến Sumatra và đảo Sumbawa', NULL, NULL, 'Là loài bướm đẹp, có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
(1942, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Athyma', NULL, 'GEN_0181', 'athymapravara', 'Athyma pravara indosinica', ' (Fruhstorfer, 1913)', '', 'SPA_01948', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1943, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Athyma', NULL, 'GEN_0181', 'athymaranga', 'Athyma ranga', 'Moore, 1857', NULL, 'SPA_01949', 'Cánh trước: Phần trước ở giữa và một đốm trắng lớn hơn ở phần trước ngọn trong tế bào; phía sau trong tế bào, ngoài đỉnh và phía dưới tại đáy khoảng gian 1, có một số đốm xanh mờ mờ; một loạt đốm trắng hình đĩa, ba đốm dài nằm xiên từ ngay phía ngoài giữa xương sườn , thêm hai đốm nữa hướng vào trong ở các khoảng giao thoa 2 và 3, một ở giữa các khoảng giao thoa 1 a và 1; vết ở khoảng trống 2 rất lớn, cắt ngắn ở bên ngoài, vết ở khoảng gian 3 kéo dài. Ngoài những đốm này, một đường bên trong và bên ngoài có các vết màu trắng ngang tương ứng với các vảy màu đen', NULL, 'tìm thấy ở tây nam Ấn Độ , Campuchia và một phần Đông Nam Á', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Athyma_ranga'),
