(1945, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Athyma', NULL, 'GEN_0181', 'athymazeroca', 'Athyma zeroca', 'Moore, 1872', 'Bướm Thượng Sỹ Nhỏ', 'SPA_01951', 'Rất giống với Athyma selenophora vì có kích thước và màu sắc tương tự như nhau nhưng hoa văn màu cam nhạt. Màu sắc và các hoa văn trên con cái và con đực rất khác nhau. Mặt trên: con đực nền màu đen, có vệt gần mép trên cánh trước, có hai hoặc ba đốm và một dải giữa cánh nổi bật kéo dài qua cả hai cánh, không có những điểm trang trí ở vùng trung tâm cánh trước; con cái: màu nâu đen xanh lục nhạt với những điểm trang trí màu trắng ngà, vệt trung tâm cánh trước gần với một đốm ở góc xa. Con cái thường to hơn con đực. Các hoa văn của con cái loài này có số lượng và cách bài trí rất giống với con cái của loài A.selenophora nhưng có màu trắng mờ, nhạt nhòa như bị phủ lên trên một màng mỏng màu xanh lục tối, chúng còn nhỏ và hẹp hơn các đốm và hoa văn của loài trên. Mặt dưới: màu nâu đỏ nhạt tím tối, có những hàng đốm đen ánh xanh lục chạy dọc theo các dải trắng ở giữa cánh và gần mép ngoài của hai cánh. . Dạng mùa mưa được tô thêm màu tím nổi bật. Sải cánh: 50 -60mm. Tương tự như loài Athyma selenophora và loài này cũng hiếm gặp. Sống ở nơi có độ cao thấp trong các khu rừng và phổ biến hơn ở các trảng cỏ, bụi cây.', NULL, ' Bắc Ấn Độ, Mianma,Hải Nam, Bắc Thái Lan, Lào, Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1946, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Auzakia', NULL, 'GEN_0189', 'auzakiadanava', 'Auzakia danava', 'Moore, [1858]', NULL, 'SPA_01952', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1947, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Cethosia', NULL, 'GEN_0350', 'cethosiabiblis', 'Cethosia biblis', '(Drury, 1773)', 'Bướm Báo Hoa Vàng ', 'SPA_01953', 'Giống Cethosia gồm những loài bướm màu sắc rất đẹp, màu cam đỏ với diềm cánh dạng răng cưa rất sâu, nhọn, viền đen. Gân 10 trên cánh trước bắt đầu từ gân 7, vùng trung tâm cánh sau có phần nhỏ đóng. Con đực và con cái có màu sắc khác nhau. Con đực loài Cethosia biblis có mặt trên cánh màu cam đỏ, nửa ngoài cánh trước màu đen với các vạch trắng hình móng ngựa và các chấm trắng xếp thành hai hàng, viền cánh đen và có các đường trắng chạy theo mép răng cưa của cánh. Mặt dưới có kiểu màu sắc phức tạp với các màu trắng, cam, đỏ, đen. Con cái tương tự con đực nhưng màu nền vàng xám đôi khi tối xậm như màu đất xỉn hơn và cánh trước có phần đen chiếm gần hết cánh. Ở loài Cethosia cyane, gần chót cánh trước có một dải xiên rộng màu trắng. Mặt trên cánh sau màu đất son, nhưng mép ngoài cánh và những hàng hoa văn, chấm chạy theo gần mép cánh có màu đen. Sải cánh: 70-80mm. Thường gặp ở khoảng trống trong rừng. Cũng phổ biến ở khu dân cư, gần nơi có cây chủ của chúng. Đẻ trứng trên dây nhãn lồng (Passiflora sp.), họ Nhãn lồng (Passifloraceae). Sâu sống thành đàn. Ở độ cao từ 700m trở lên loài này phân bố ở mọi sinh cảnh  và phổ biến ở độ cao trên 1.200m, các khu rừng thứ sinh và chúng còn phổ biến ở các khu nông nghiệp ở độ cao dưới 700m.', NULL, ' Ấn Độ, Mianma, Trung Quốc, Hải Nam, Hồng Kông, Philippin, Malaixia, Thái Lan, Lào, Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1948, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Cethosia', NULL, 'GEN_0350', 'cethosiacyane', 'Cethosia cyane', '(Drury, 1773)', 'Bướm báo hoa vàng', 'SPA_01954', 'Bướm đực loài Cethosia cyane có mặt trên cánh màu cam hơi đỏ hoặc cam vàng, rất dễ nhầm với loài Cethosia bilis nhưng gần chót cánh trước có một mảng xiên rộng có màu trắng nằm gọn trong nửa ngoài màu đen của cánh trước, ngoài ra ở phần nửa phía mép ngoài cánh trước còn có các vạch trắng hình móng ngựa xếp theo mép ngoài và các chấm trắng xếp thành một hàng, chạy song song ở sát hàng móng ngựa về phía trong cánh, viền cánh đen và có các đường trắng chạy theo mép răng cưa của cánh. Mặt dưới có kiểu màu sắc phức tạp với các màu trắng, cam, vàng, đen. Bướm cái tương tự bướm đực nhưng màu nền trắng xám hoặc trắng ngà và cánh trước vẫn có dải trắng nằm trong phần đen chiếm gần hết cánh. Mặt trên cánh sau hoa văn màu đen được bài trí tương tự như ở loài Cethosia biblis nhưng có màu nền trắng ngà ở giữa cánh và có viền mép trên và mép ngoài màu đen. Sải cánh: 75-85mm Loài này thích độ cao trung bình và thấp. Chúng bay khá thấp và chậm. Chúng gặp ở rừng phục hồi, rừng thứ sinh, ở đó bướm cái đẻ trứng trên lá những cây Lạc tiên Passiflora foetida thuộc họ Lạc tiên Passifloraceae. Đôi khi chúng ta còn gặp chúng ở các bụi tre, trúc thuộc họ Cỏ Poaceae để hút nhựa của cây tiết ra. Thường gặp ở khoảng trống trong rừng. Cũng phổ biến ở khu dân cư, gần nơi có cây chủ của chúng. Đẻ trứng trên Dây nhãn lồng Passiflora foetida, họ Nhãn lồng (Passifloraceae). Sâu sống thành đàn. Loài này thích độ cao trung bình và thấp ở Vân Nam, Trung Quốc có thể thấy chúng ở độ cao 600-1200m. Chúng bay khá thấp và chậm. Chúng ở rừng phục hồi thứ sinh, ở đó bướm cái còn đẻ trứng trên lá những cây thuộc họ Nhãn lồng (Passifloraceae). Cây chủ của chúng còn có thể là cây chủ của loài bướm Argynnis niphe', NULL, 'Bướm thường phổ biến khắp Việt Nam nhưng ở miền Bắc gặp nhiều hơn Phân bố từ Bắc Ấn Độ đến Mianma, Thái Lan và Đông Dương', NULL, NULL, 'Là loài bướm đẹp', NULL, NULL, NULL, 'VN Creature'),
(1949, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Charaxes', NULL, 'GEN_0367', 'charaxesaristogiton', 'Charaxes aristogiton peridoneus', 'Fruhstorfer, 1914', NULL, 'SPA_01955', 'thân hình như càng cua, tính tình dũng cảm. Trước khi biến thành bướm, ấu trùng nhộng có màu xanh lam và có bốn sừng trên đầu nên thường bị nhầm với loài gây hại kỳ quái. Do kích thước lớn nên thời gian sinh trưởng của côn trùng đặc biệt dài. Sau khi biến đổi bướm, thời gian tồn tại của nó chỉ hơn 20 ngày, nói chung, nó sẽ già đi và chết sau khi giao phối và đẻ trứng.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.'),
(1950, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Charaxes', NULL, 'GEN_0367', 'charaxesbernardus', 'Charaxes bernardus hierax', '(C. & R. Felder, 1867)', 'Bướm đuôi BECNA ', 'SPA_01956', 'Các đại diện thuộc giống Charaxes có màu cơ bản là nâu đỏ đến nâu tối hoặc màu đất son và bọn chúng được tạo hóa ban tặng một màu rực lửa, có nhiều loài to thứ nhất thứ hai trong họ Bướm Giáp. Chúng thường có hai gai đuôi hoặc nhú đuôi một dài một ngắn, đôi khi đuôi ngắn như bị biến mất. C.bernardus là loài phổ biến nhất trong giống Charaxes. Mặt trên cánh màu cam với viền đen rộng ở chót và mép cánh trước. Cánh sau có một đuôi ngắn dạng răng. Con cái lớn hơn con đực, một đuôi dài hơn rõ rệt; một nhú đuôi ngắn và vùng giữa cánh trước với vùng giữa về mép trên cánh sau màu trắng. Mặt dưới con đực màu nâu với các đường mảnh màu đen chạy ngoằn ngoèo từ gốc cánh ra. Một số loài như C.marmax và C.aristogiton có kiểu mặt dưới cánh rất giống, không thể phân biệt được bằng quan sát. Bướm đực có một vài dạng khác nhau cả về kích thước và màu sắc; sự phong phú của chúng phụ thuộc vào vùng địa lý. Sải cánh: 80 - 110mm. Loài này có thể dễ dàng gặp ở những nơi trống trải với độ cao vừa và thấp. Gặp ven đường mòn trong rừng, hút chất khoáng từ các bãi phân thú. Bay rất nhanh, cánh đập mạnh, đôi khi có thể nghe thấy khi nó bay lại gần, khi bay, ánh màu cam và viền đen ở mặt trên thấp thoáng. Sâu ăn lá cây Bí bai Acronychia pedunculata, họ Cam quýt Rutaceae. C.bernardus dạng màu nâu thường phổ biến hơn. Loài này có thể dễ dàng gặp ở những nơi trống trải với độ cao vừa và thấp. Tập tính của loài này giống như những loài bướm nói trên nhưng sâu non sống trên cây họ Cam và Long não.', NULL, 'Xuất hiện mọi nơi ở Việt Nam, có cả ở thành phố Hồ Chí Minh. Từ Ấn Độ đến Nam Trung Quốc, Đông Dương và bán đảo Mã-lai, phía Nam đến những đảo lớn của quần đảo San-đa.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1951, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Charaxes', NULL, 'GEN_0367', 'charaxesmarmax', 'Charaxes marmax marmax', '(Westwood, 1847)', ' Bướm đuôi MAMAX', 'SPA_01957', 'Mặt trên tương tự như phân loài Charaxes.bernadus, nhưng không có dải trắng và có viền mép ngoài cánh màu đen rất đẹp ở cánh trước. Cũng trên cánh trước còn có một chấm đen ở nơi đóng của vùng trung tâm và một chấm hình trăng lưỡi liềm ở xa hơn về phía đuôi cánh - Ở cánh sau có một chuỗi các đốm đen hình cái nêm có kích cỡ to, nhỏ khác nhau rải theo gần sát mép ngoài cánh. Mặt dưới màu vàng đất son ánh xanh đỏ, vùng trung tâm có những đường màu tối đứt quãng. Sải cánh: 90-120mm. Loài này chỉ gặp ở những nơi rừng còn tốt, chúng thường tập trung với một số loài bướm khác hút các chất thải của động vật rừng với độ cao vừa và thấp dưới 1000m. Tập tính của loài này giống như nhưng loài bướm Charaxes bemardus sâu non sống trên những cây họ Cam Rutaceae và họ Long não Lauraceae. Loài hiếm gặp hơn so với Charaxes bemardus', NULL, 'Xuất hiện nhiều nơi ở Việt Nam. Vùng phân bố từ Ấn Độ đến Nam Trung Quốc, Đông Dương và bán đảo Malaysia, phía Nam đến những đảo lớn của quần đảo San đa.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1952, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Charaxes', NULL, 'GEN_0367', 'charaxessolon', 'Charaxes solon sulphureus', '(Rothschild, 1900)', '', 'SPA_01958', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1953, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Chersonesia', NULL, 'GEN_0373', 'chersonesiaintermedia', 'Chersonesia intermedia rahrioides', '(Moore, [1896])', '', 'SPA_01959', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1954, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Chersonesia', NULL, 'GEN_0373', 'chersonesiarisa', 'Chersonesia risa', '(Doubleday, 1848)', 'Bướm Bản Đồ Nhỏ Nâu Cam Đỏ ', 'SPA_01960', 'Đặc điểm giống Chersonesia gồm những loài bướm có kích thước nhỏ bé với màu nền nâu cam đỏ và những sọc, dải chạy ngang cánh. Loài Chersonesia.risa có mặt trên con đực màu vàng nâu nhạt, có các dải nâu tối kéo dài từ đỉnh trên cánh trước cho tới đỉnh dưới và mép trong cánh sau, có một  chiếc nhú đuôi rất kín và nhỏ ở cuối gân 4; con cái lớn hơn, có màu đất nhạt. Mặt dưới: giống như mặt trên nhưng được trang trí nhạt hơn. Sải cánh: 40-45mm. Sống ở vùng đồi núi và trong các khu rừng thường xanh ở các tỉnh phía Nam. Ở miền Đông Nam bộ chúng thường xuất hiện ở các khu rừng còn tốt vào giữa và cuối mùa mưa hàng năm, bay chậm và thường có tập tính quay lại nơi thường đậu khi bi xua đuổi.', NULL, 'Khá hiếm ở miền Bắc và nhiều ở miền Đông nam bộ.  Ấn Độ, Mianma, Trung Quốc, Hải Nam, Thái Lan, Lào, Camphuchia, Malaixia, Inđônêxia, Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1955, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Cirrochroa', NULL, 'GEN_0418', 'cirrochroaaoris', 'Cirrochroa aoris', 'Doubleday, 1847', NULL, 'SPA_01961', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1956, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Cirrochroa', NULL, 'GEN_0418', 'cirrochroaemalea', 'Cirrochroa emalea', '(Guerin-Meneville, 1843)', '', 'SPA_01962', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1957, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Cirrochroa', NULL, 'GEN_0418', 'cirrochroaorissa', 'Cirrochroa orissa chione', '(Riley & Godfrey, 1921)', '', 'SPA_01963', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1958, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Cirrochroa', NULL, 'GEN_0418', 'cirrochroasp', 'Cirrochroa sp.', NULL, NULL, 'SPA_01964', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1959, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Cirrochroa', NULL, 'GEN_0418', 'cirrochroasurya', 'Cirrochroa surya siamensis', '(Fruhstorfer, 1906)', '', 'SPA_01965', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1960, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Cirrochroa', NULL, 'GEN_0418', 'cirrochroatyche', 'Cirrochroa tyche', 'C. & R. Felder, 1861', 'Bướm Gia Đình', 'SPA_01966', 'Giống này gồm các loài tương đối giống các loài thuộc giống Vindula sp. nhưng râu của Cirrochroa mảnh mai hơn rất nhiều và chỉ to ra rõ rệt ở đoạn đầu mút. Vùng trung tâm cánh sau mở. C.tyche là loài phổ biến nhất trong số năm loài thuộc giống Cirrochroa đã biến mất ở Việt Nam. Mặt trên màu cam nâu, cánh trước viền đen mảnh, có các đường màu đen gợn sóng chạy ngang ở vùng ô cánh và sát mép ngoài cánh sau. Con cái màu nhạt hơn con đực và các đốm đường viền màu đen loang rộng hơn. Con đực loài C.surya trông tương tự, nhưng kích thước hơi nhỏ hơn, mép ngoài cánh trước có viền đen rõ và rộng hơn, đặc biệt là vùng chót cánh trước. Sải cánh : 65-75mm. Thường ra đường mòn hút chất khoáng. Tập tính tương tự loài Cupha erymanthis và Vagrans egista tuy nhiên bay không nhanh như hai loài đó. Sâu của giống Cirrochroa được ghi nhận ăn lá giống cây Nhọ nồi Hydnocarpus sp., họ Mùng quân Flacourtiaceae.  Loài này sống ở mọi độ cao, đặc biệt phổ biến ở độ cao 1.200m và các rừng thứ sinh, trảng cỏ, bụi cây.', NULL, ' Sikkim, Mianma, Thái Lan, Lào, Inđônêxia, Philippin, và toàn Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1961, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Cupha', NULL, 'GEN_0508', 'cuphaerymanthis', 'Cupha erymanthis', '(Drury, 1773)', 'Bướm Giáp Mộc ', 'SPA_01967', 'Giống này cũng chỉ có một loài. Loài Cuphia erymanthis có mặt trên cánh màu cam nâu, chót cánh trước có vùng màu đen rộng với hai đốm trắng, phần giữa cánh trước có một vùng màu vàng chanh lớn, cánh sau viền nâu tối cùng với hai dải nâu đen lượn sóng cùng nhịp với mép ngoài  và có một hàng gồm 5 chấm đen nhỏ ở phía trong. Mặt dưới sáng màu hơn mặt trên với vùng chót cánh trước màu đất son. Con đực và con cái có kiểu màu sắc giống nhau. Sải cánh: 45-50mm. Phố biến nhưng ít gặp với số lượng lớn. Bay nhanh, ít khi đậu một thời gian lâu, khó lại gần. Thường ra đường mòn hút chất khoáng. Hay đậu ở ven khoảng trống trong rừng gỗ thứ sinh. Khi vừa đậu thường bò đi bò lại trên mặt đất. Ở độ cao dưới 700m, chúng còn sinh sống ở các trảng cỏ, bụi cây và vùng nông nghiệp.Ấu trùng được ghi nhận ăn trên các loài cây thuộc giống Hồng quân Flacourtia, họ Mùng quân Flacourtiaceae.', NULL, 'toàn Việt Nam, có cả ở thành phố Hồ Chí Minh. Từ Bắc Ấn Độ đến Thái Lan, Lào, Malaixia, Inđônêxia', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1962, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Cynitia', NULL, 'GEN_0530', 'cynitiacocytus', 'Cynitia cocytus', '(Fabricius, 1787).', NULL, 'SPA_01968', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1963, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Cynitia', NULL, 'GEN_0530', 'cynitialepidae', 'Cynitia lepidae', '(Butler,1868).', NULL, 'SPA_01969', 'Mặt trên màu nâu sẫm, nhạt hơn ở con cái, với các vạch ngang màu đen rất ngoằng ngoèo chạy ngang qua bờ của cả cánh trước và cánh sau và một dải đĩa xiên trên cánh trước; một dải màu xám tro dọc theo đáy của cả cánh trước và cánh sau, dần dần mở rộng từ đỉnh của cánh trước, rất hẹp, đến ô cánh sau, nó bao phủ khoảng một phần ba cánh. Ở con cái, dải này có viền hẹp bên ngoài với màu nâu. Vảy ở đáy cánh có màu trắng. Râu, đầu, ngực và bụng phía trên màu nâu sẫm; bên dưới, các vảy có màu đỏ hung và phần ở giữa có màu trắng sẫm được bao phủ bởi lớp vảy màu nâu. Mặt dưới: Con đực màu nâu đất, con cái màu nâu sáng. Ở cả hai giới, màu nhạt hơn ở cánh sau; cánh trước hơi hẹp, cánh sau rộng hơn nhiều có màu xám hoa cà ở đáy cuối và dọc theo mép lưng của cánh sau; các tế bào của cả hai cánh với các đường ngang uốn lượn màu nâu sẫm và các đường màu đen hình vòng; cả cánh trước và cánh sau được cắt ngang bởi các sọc tối rộng hơi khuếch tán và hậu đĩa hẹp hơn, nổi bật ở cánh trước, mờ ở cánh sau. Con đực có một mảng vảy sẫm màu riêng biệt phía trên gân thứ tư ở mặt trên của cánh sau.', NULL, 'Loài này được tìm thấy ở vùng hạ lưu Himalaya về phía đông từ Almora, Ghat Tây, miền trung Ấn Độ, Orissa, Bengal và vào Assam và Bán đảo Mã Lai. Chúng sống trong rừng', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Tanaecia_lepidea'),
(1964, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Cyrestis', NULL, 'GEN_0537', 'cyrestiscocles', 'Cyrestis cocles', 'Fabricius 1787', 'Bướm Bản Đồ Cẩm Thạch ', 'SPA_01970', 'Đặc điểm giống: Cyrestis là giống bướm có màu nền sáng (trắng, trắng vàng) với các đường vân mảnh sậm màu trên cánh, phối hợp với gân cánh chạy gần như vuông góc tạo thành ô, khiến cho chúng có tên là Cánh bản đồ (Map wing). Con đực và cái giống nhau. Việt Nam có bốn loài giống Cyrestis, tất cả đều chủ yếu phân bố trong rừng. C.nivea gần giống Cyrestis thyodamas, được phân biệt bởi các đường mảnh ở vùng giữa cánh của C.nivea chạy tương đối thẳng chứ không ngoằn ngoèo như ở Cyrestis thyodamas, ngoài ra đường viền màu đen chạy gần mép cánh trông rõ rệt hơn loài C.thyodamas. Hai loài còn lại là C.themire và Cyrestis cocles. Cyrestis cocles có nền cánh màu trắng kem với nhiều vệt song song màu nâu nhạt kéo dài từ bờ trước cánh trước đến bờ sau cánh sau; cánh sau có một đuôi nhọn ở gân 4. Cánh trước có các đốm mắt phân bố trong khoảng 1b, 2, 4 đến 6; mặt trên cánh sau, các đốm mắt phân bố dài thành hàng dọc theo bờ bên cánh. Mùa mưa loài có màu sắc sậm hơn và các đốm mắt cũng rõ hơn dạng mùa khô. Con đực có bờ bên cánh hơi gợn sóng hơn so với con cái. Loài thường gặp ở những vùng rừng thưa, đất ẩm, hút khoáng từ đất. Loài ít bay, đậu ở cả mặt trên và mặt dưới lá. Khi đậu, thường mở rộng cánh và ép xuống bề mặt lá. Hình thái loài và tập tính đậu giúp loài ngụy trang như một tấm mạng nhện trên lá hoặc đốm bệnh của lá. âu của giống Cyrestis được nghi nhận ăn lá một số loài cây trong họ Dâu tằm (Moraceae). Loài Cyrestis thyodamas thích những nơi trống trải (bờ suối và sông) và những con đường làng ở độ cao vừa và thấp. Chúng bay gần mặt đất, đôi khi bướm đậu ở dưới mặt lá. Sâu non ăn lá cây Sung (họ Dâu tằm Moraceae) như các cây: Ficus bengalensis, Ficus  religiosa, Ficus  nemoralis.       ', NULL, ' Phân bố rất rộng từ Đông Apganistan đến Nam Trung Quốc và Nhật Bản, phía Nam qua Mianma và Thái Lan đến Đông Dương, San-đơ-lan và Tân Ghi-nê.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1965, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Cyrestis', NULL, 'GEN_0537', 'cyrestisnivea', 'Cyrestis nivea tonkiniana', '(Fruhstorfer, 1901)', 'Bướm bản đồ cánh thẳng ', 'SPA_01971', 'Loài Cyrestis nivea tương tự như loài Cyrestis thyodamas nhưng các đường ngang không chạy thẳng và dải sau đĩa cánh ở mặt trên cánh sau mờ hơn và vùng có màu đất son ở vùng gốc cánh gần như màu đen, có đường rất mảnh xanh thép chạy dọc theo phía trong của các mép cánh. Thùy và đuôi cánh sau nhô ra dài và rất mềm mại. Sải cánh: 50 - 60mm. Con đực và cái giống nhau. Ở Việt Nam có bốn loài giống Cyrestis, tất cả đều chủ yếu phân bố trong rừng. Cyrestis nivea gần giống Cyrestis thyodamas, được phân biệt bởi các đường mảnh ở vùng giữa cánh của Cyrestis nivea chạy tương đối thẳng chứ không ngoằn ngoèo như ở Cyrestis thyodamas, ngoài ra đường viền màu đen chạy gần mép cánh trông rõ rệt hơn loài Cyrestis thyodamas Thường gặp vào đầu mùa mưa. Bay thấp, cánh đập gắt, khó quan sát khi bay. Chúng hay sà xuống mặt đất để hút chất khoáng, khi đậu thường xoè cánh. Khi cảm thấy bị đe doạ chúng thường bay vào một cây bụi, đậu ngược ở mặt dưới lá cây. Nếu người quan sát tiếp tục đến gần, nó lại bay nhanh ra xa và đậu ở tư thế tương tự. Sâu của giống Cyrestis được nghi nhận ăn lá một số loài cây trong họ Dâu tằm (Moraceae). Loài Cyrestis nivea thích những nơi trống trải (bờ suối và sông) và những con đường làng ở độ cao vừa và thấp. Chúng bay gần mặt đất, đôi khi bướm đậu ở dưới mặt lá. Sâu non ăn lá cây Sung (họ Dâu tằm Moraceae) như các cây: Ficus bengalensis, Ficus  religiosa, Ficus  nemoralis.   ', NULL, 'Gặp khắp nơi ở Việt Nam.  Phân bố rất rộng từ Đông Apganistan đến Nam Trung Quốc và Nhật Bản, phía Nam qua Mianma và Thái Lan đến Đông Dương, San-đơ-lan và Tân Ghi-nê. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
