ông Apganistan đến Nam Trung Quốc và Nhật Bản, phía Nam qua Mianma và Thái Lan đến Đông Dương, San-đơ-lan và Tân Ghi-nê. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1967, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Cyrestis', NULL, 'GEN_0537', 'cyrestisthyodamas', 'Cyrestis thyodamas', '(Boisduval, 1836)', NULL, 'SPA_01973', 'Đặc điểm giống: Cyrestis là giống bướm có màu nền sáng (trắng, trắng vàng) với các đường vân mảnh sậm màu trên cánh, phối hợp với gân cánh chạy gần như vuông góc tạo thành ô, khiến cho chúng có tên là Cánh bản đồ (Map wing). Con đực và cái giống nhau. Việt Nam có bốn loài giống Cyrestis, tất cả đều chủ yếu phân bố trong rừng. C.nivea gần giống Cyrestis thyodamas, được phân biệt bởi các đường mảnh ở vùng giữa cánh của C.nivea chạy tương đối thẳng chứ không ngoằn ngoèo như ở Cyrestis thyodamas, ngoài ra đường viền màu đen chạy gần mép cánh trông rõ rệt hơn loài C.thyodamas. Hai loài còn lại là C.themire và C.cocles. C.cocles có hai dạng khác hẳn nhau, dạng earli và dạng cocles. Hai loài này đều dễ nhận diện. Bướm cái của loài này rất khác nhau. Có hai dạng màu sắc: bướm đực thường trắng và bướm cái có màu nâu non. Những mẫu tiêu bản của dạng bướm mùa mưa có những vết tối màu hơn. Loài C.thyodamas: tương tự như loài C.nivea nhưng các đường ngang không chạy thẳng và dải sau đĩa cánh ở mặt trên cánh sau mờ hơn và vùng có màu đất son ở vùng gốc cánh gần như màu đen, có đường rất mảnh xanh thép chạy dọc theo phía trong của các mép cánh. Thùy và đuôi cánh sau nhô ra dài và rất mềm mại. Sải cánh: 50-60mm. Tất cả các loài trong giống Cyrestis đều phổ biến trong rừng và xuất hiện nhiều theo mùa. Thường gặp vào đầu mùa mưa. Bay thấp, cánh đập gắt, khó quan sát khi bay. Chúng hay sà xuống mặt đất để hút chất khoáng, khi đậu thường xoè cánh. Khi cảm thấy bị đe doạ chúng thường bay vào một cây bụi, đậu ngược ở mặt dưới lá cây. Nếu người quan sát tiếp tục đến gần, nó lại bay nhanh ra xa và đậu ở tư thế tương tự. Sâu của giống Cyrestis được nghi nhận ăn lá một số loài cây trong họ Dâu tằm (Moraceae). Loài Cyrestis thyodamas thích những nơi trống trải (bờ suối và sông) và những con đường làng ở độ cao vừa và thấp. Chúng bay gần mặt đất, đôi khi bướm đậu ở dưới mặt lá. Sâu non ăn lá cây Sung (họ Dâu tằm Moraceae) như các cây: Ficus bengalensis, Ficus  religiosa, Ficus  nemoralis.              ', NULL, ' Phân bố rất rộng từ Đông Apganistan đến Nam Trung Quốc và Nhật Bản, phía Nam qua Mianma và Thái Lan đến Đông Dương, San-đơ-lan và Tân Ghi-nê. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1968, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Dichorragia', NULL, 'GEN_0579', 'dichorragianesimachus', 'Dichorragia nesimachus', '(Doyère, [1840])', '  ', 'SPA_01974', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1969, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Discophora', NULL, 'GEN_0592', 'discophoracelinde', 'Discophora celinde', '(Stoll, 1790)', '', 'SPA_01975', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1970, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Discophora', NULL, 'GEN_0592', 'discophoradeode', 'Discophora deode', 'de Nicéville, 1898', NULL, 'SPA_01976', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1971, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Discophora', NULL, 'GEN_0592', 'discophorasondaica', 'Discophora sondaica', 'Boisduval , 1836', NULL, 'SPA_01977', 'Đặc điểm giống: có cánh trước hình tam giác rộng với đỉnh nhọn và hơi dài. Gân 11 của cánh trước nối với gân 12 và gân 10. Vùng trung tâm cánh sau mở rộng và viền của nó hơi dài ở gân 4. Ở con đực, ở phần chính của gân 3,4 của mặt trên cánh sau những vẩy đặc biệt tạo thành một mảng tròn lồi lên. Con cái lớn hơn với trang trí sáng hơn ở con đực. Loài D.sondaica có mặt trên con đực màu nâu tối, cánh trước có 3 hàng đốm không đầy đủ nằm ngang màu vàng xếp từ giữa cánh ra ngoài mép cánh, cánh sau không có các dãy đốm nhưng vùng giữa là màu tối; con cái màu nâu nhạt hơn, hàng đốm mờ nhạt tìm thấy ở cả hai cánh, có vệt vàng ở gần mép trên và mép dưới khoảng giữa mép trên cánh sau, mép cánh sau gấp góc ở gân 4. Mặt dưới: màu nâu nhạt hơn, với vùng gốc và vùng giữa tối; ở cánh sau có mắt ở khoảng 2 và khoảng 6. Sải cánh: 80-90mm. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(1972, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Discophora', NULL, 'GEN_0592', 'discophoratimora', 'Discophora timora timora', '(Westwood, [1850])', '', 'SPA_01978', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1973, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Doleschallia', NULL, 'GEN_0598', 'doleschalliabisaltide', 'Doleschallia bisaltide', 'Cramer, 1778', NULL, 'SPA_01980', 'Đặc điểm nhận dạng:\n\nCó dáng dấp kiểu bướm lá - Kallima inachus nhưng có kích thước nhỏ hơn. Mặt dưới cánh có kiểu màu sắc nguỵ trang hoàn  hảo, bắt chước cái lá héo, thậm chí có cả những đốm vệt bắt chước dấu sâu ăn. Gần như không bao giờ thấy hai cá thể có mặt dưới cánh giống nhau. Chót cánh trước bị cắt cụt chứ không nhọn như ở loài Kallima inachus và ở vùng màu đen của chót cánh có 1 chấm trắng nhỏ ở con đực và 2 chấm nhỏ ở con cái. Mặt trên con đực và cái tương tự nhau, nhưng vạch màu cam ở vùng chót cánh trước của con cái lớn hơn. Mảng cam ở phía chót cánh trước được ngăn cách với vùng cam còn lại từ giữa cánh đến mép trong cánh trước bằng một dải màu đen chạy dài từ mép ngoài thẳng qua giữa cánh cho đến gần mép trên cánh. Mép ngoài các cánh nâu đen hoặc đen. Phần còn lại của các cánh có màu nâu đỏ và nâu tối. Rất dễ nhận biết nếu thấy mặt trên cánh, nhưng loài này thường xếp cánh khi đậu. Bướm cái nhạt màu hơn, nhìn chung màu sắc của chúng thường rất khác nhau. Sải cánh: 75-85mm.\n\nSinh học sinh thái:\n\nBay rất nhanh, đường bay gắt, khó quan sát. Thường ra khoảng trống, dọc đường mòn trong rừng để tìm hút chất khoáng, cũng gặp hút mật ở những bãi trống, cây bụi có hoa. Ở trong rừng loài này cũng hay sà vào người để hút chất khoáng có trong mồ hôi. Khi cảm thấy bị đe doạ, nó thường bay ngược trở lại vào rìa đường mòn và đậu lên một cây cao, đầu hướng về phía nó cảm thấy bị de doạ. Sâu được ghi nhận ăn lá một số loài như cây Ngọc diệp Graphtophyllum pictum, cây Xuân hoa Pseuderanthemum malabaricum, họ Ô rô Acathaceae, Mít Artocarpus heterophyllus, họ Dâu tằm Moraceae. Chúng thích trên đường và những lối nhỏ trong rừng, những nơi rừng bị chặt ở độ cao vừa và thấp. Phụ thuộc vào từng nơi, sâu non bám thành từng đám ăn cây ký chủ ', NULL, 'Phân bố rất rộng từ Ssilanca và Ấn Độ qua Sunthelan đến Australlia, Thái Lan, Lào, có mọi nơi ở Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1974, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Ethope', NULL, 'GEN_0676', 'ethopediademoides', 'Ethope diademoides', '(Moore, [1893])', '', 'SPA_01981', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1975, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Ethope', NULL, 'GEN_0676', 'ethopenoirei', 'Ethope noirei', '(Janet, 1896)', NULL, 'SPA_01982', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1976, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Eulacera', NULL, 'GEN_0684', 'eulaceraosteria', 'Eulacera osteria', '(Westwood, [1850])', '', 'SPA_01983', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1977, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Euripus', NULL, 'GEN_0695', 'euripusnyctelius', 'Euripus nyctelius', '(Doubleday, 1845)', NULL, 'SPA_01984', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1978, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Euthalia', NULL, 'GEN_0705', 'euthaliaaconthea', 'Euthalia aconthea', '(Fruhstorfer, 1906)', '', 'SPA_01985', 'Đặc điểm nhận dạng:\n\nBướm cái lớn hơn bướm đực, cánh sau lượn tròn hơn. Con đực màu nâu, có  4 đến 6 đốm trắng chạy từ giữa bờ cánh trước  vào trong. Con cái màu sáng hơn, do kích thước lớn hơn và các đốm trắng lớn hơn và phần vòi hút có màu xanh ngọc. Mặt dưới cánh có màu nâu sáng ở con cái và nâu đậm ở con đực, hoặc giống như mặt trên, có thể có những đường viền zigzắc ở phía ngoài cánh . Sải cánh: 55 -75mm.\n\nSinh học, sinh thái:\n\nLoài này xuất hiện chủ yếu ở những vùng thấp và đồi gò. Chúng ưa thích nơi sống vùng làng quê, ngoại ô thành phố nằm gần những trang trại cây ăn quả. Bướm bay khá thấp gần mặt đất và bị hấp dẫn bởi mùi quả thối. Sâu non sống trên cây Điều Anacardium occidentale và Xoài Mangifera indica thuộc họ Đào lộn hột Anacardiaceae.', NULL, 'Vùng phân bố từ Srilanca đến Ấn Độ đến Nam Trung Quốc, và qua lục địa Đông nam châu Á. Ở Việt Nam, loài này phân bố hầu khắp nhưng chỉ phổ biến ở một số vùng phía Nam. Bướm được đặt tên do có 3 đốm sáng trên cánh.\n\n ', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1979, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Euthalia', NULL, 'GEN_0705', 'euthaliaalbopunctata', 'Euthalia albopunctata', '(Fabricius, 1793)', NULL, 'SPA_01986', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1980, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Euthalia', NULL, 'GEN_0705', 'euthaliaalpheda', 'Euthalia alpheda verana', '(Fruhstorfer, 1913)', '', 'SPA_01987', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1981, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Euthalia', NULL, 'GEN_0705', 'euthaliacocytus', 'Euthalia cocytus', '(Fabricius) ', NULL, 'SPA_01988', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1982, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Euthalia', NULL, 'GEN_0705', 'euthaliadirtea', 'Euthalia dirtea', '(Fabricius, 1793)', NULL, 'SPA_01989', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1983, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Euthalia', NULL, 'GEN_0705', 'euthaliaeriphylae', 'Euthalia eriphylae lioneli', 'Fruhstorfer, 1905', NULL, 'SPA_01990', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1984, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Euthalia', NULL, 'GEN_0705', 'euthaliaevelina', 'Euthalia evelina', 'Pinratana,1979', 'Bướm Nam Tước Chấm Đỏ ', 'SPA_01991', 'Mặt trên: con đực màu nâu tối với một đốm đỏ cong hình trăng khuyết ở vùng trung tâm cánh trước, màu nâu sậm hơn ở vùng gốc và vùng ô cánh ở mép trên gần chót cánh trước có một vệt sáng trắng hẹp, con cái lớn hơn con đực có màu xám nhạt với đuôi cánh trước cong hơn và cũng có một hoặc nhiều đốm đỏ trang trí cho vùng trung tâm cánh trước. Có một dải rộng ngang và hơi trắng dễ thấy ở vùng giữa chạy từ mép trên tới mép dưới cánh trước. Ở cánh sau cũng có dải sáng mờ nhưng hẹp hơn và không chạy tới mép trong cánh. Mặt dưới màu xanh lục xám với một hoặc nhiều hơn số chấm đỏ ở vùng hoa văn thuộc gốc cánh sau, đồng thời vẫn có một chấm đỏ ở trung tâm của cánh trước. Sải cánh: 90 -110 mm. Loài thường gặp đơn lẻ từng cá thể trong các rừng thưa, bay thấp, đậu nơi có nhiều lá khô vì đây là môi trường thuận lợi để ngụy trang. Ở vùng rừng tương đối râm mát, đất ẩm (đặc biệt khi nắng lớn), có thể gặp nhiều cá thể tập trung hút khoáng hoặc dịch trái cây chín cùng với các loài khác trong nhóm Euthalia, Tanaecia.', NULL, 'Phú Thọ (Tam Đảo, Xuân Sơn) Ba Vì, Hòa Bình Cambodia, Thailand.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1985, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Euthalia', NULL, 'GEN_0705', 'euthaliaiva', 'Euthalia iva buensis', 'Monastyrskii, Nguyen & Yokochi, 2000', NULL, 'SPA_01992', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1986, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Euthalia', NULL, 'GEN_0705', 'euthalialubentina', 'Euthalia lubentina lubentina', '(Cramer, [1777])', '', 'SPA_01993', 'Mặt trên: ở những cá thể đực có màu nền nâu xanh lục nhạt với các đốm đỏ ở cả hai cánh. Những đốm này ở cánh trước nằm bên cạnh vùng trung tâm, các đốm trắng ở gần góc trên cánh trong khoảng 3,4,5,6 không tạo thành một đường thẳng; con cái có một hàng những mảng màu trắng ở vùng giữa sát mép ngoài cánh, và cũng có một mảng màu trắng ở đỉnh trên của vùng trung tâm. Con cái lớn hơn con đực. Mặt dưới: màu xanh da trời nhạt bóng với những đốm đỏ sáng - bướm đực và bướm cái đều có những chân trước màu đỏ nhạt. Sải cánh:  55 - 70mm. Sống trong những vùng rừng ẩm nơi đất thấp. Khá hiếm. Phân bố ở độ cao thấp hơn 1300m, phổ biến hơn khi xuống thấp ở các khu rừng và trảng cỏ, bụi cây, chỉ sống ở các trảng cỏ bụi cây hay những khu vực ẩm thấp.', NULL, 'Ở Việt Nam được tìm thấy từ Bắc đến Nam trong các khu rừng thường xanh đến 1200m. Bắc Ấn Độ, Mianma, Nam Trung Quốc, Thái Lan, Lào,Malaixia.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(1987, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Euthalia', NULL, 'GEN_0705', 'euthaliamonina', 'Euthalia monina', 'Moore, 1787', NULL, 'SPA_01994', 'Bướm cái và bướm đực khác nhau. Mặt trên cánh bướm đực có màu nâu xỉn và một dốm màu trắng khá rõ nằm giữa cánh trước, chóp và phần rìa cánh trước và một vùng nằm ở gốc cánh sau có màu nâu sẫm. Phần mặt trên và mặt dưới cánh của bướm cái giống nhau một mảng màu trắng đục nằm giữa hai cánh chia hai phần còn lại có màu nâu sậm. Con cái lớn hơn con đực, màu nâu nhạt với dải vùng giữa gần mép ngoài cánh được tô điểm bằng những mảng có màu hơi trắng. Mặt dưới: màu nâu sáng, hoặc giống như mặt trên, có thể có những đường viền zigzắc ở phía ngoài cánh . Sải cánh: 50 -70mm. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(1988, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Euthalia', NULL, 'GEN_0705', 'euthaliapardalis', 'Euthalia pardalis', '(Corbet, 1941)', NULL, 'SPA_01995', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1989, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Euthalia', NULL, 'GEN_0705', 'euthaliaphemius', 'Euthalia phemius', 'Doubleday, 1848', NULL, 'SPA_01996', 'Bướm có kích thước trug bình, mặt trên ở con đực: màu nâu tối, vệt cánh trước vượt xa hơn vùng trung tâm, cánh sau màu xanh ở mép ngoài và góc chót, góc dưới hình tam giác. Con cái lớn hơn con đực và cánh trước có dải vắt chéo từ giữa mép trên xuống góc dưới mép ngoài cánh tạo thành một dải màu trắng rộng trang trí cho cánh. Mặt dưới: màu xanh nhạt, mép ngoài có màu hoa oải hương (xanh nhạt hơi pha đỏ). Sải cánh: từ 60 - 80mm. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(1990, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Euthalia', NULL, 'GEN_0705', 'euthaliarecta', 'Euthalia recta monilis', '(Moore, 1897)', '', 'SPA_01997', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1991, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Euthalia', NULL, 'GEN_0705', 'euthaliasp', 'Euthalia sp.', NULL, NULL, 'SPA_01998', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1992, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Euthalia', NULL, 'GEN_0705', 'euthaliateuta', 'Euthalia teuta', '(Doubleday, 1848)', '', 'SPA_01999', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1993, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Herona', NULL, 'GEN_0869', 'heronamarathus', 'Herona marathus marathon', 'Fruhstorfer, 1906', NULL, 'SPA_02000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1994, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Hestina', NULL, 'GEN_0873', 'hestinanama', 'Hestina nama', '(Doubleday, 1844)', NULL, 'SPA_02001', 'Giống này gồm các loài bướm mạo danh loài Dananus melaneus của họ Bướm đốm. Chúng có màu xám xanh với các gân màu tối. Mặt trên: Màu đen với các hoa văn màu trắng xanh nhạt tương tự như loài Danaus melaneus; đỉnh chót cánh trước và cả cánh sau như được nhuộm màu đỏ. Mặt dưới: Trang trí giống như mặt trên, nhưng đỉnh chót cánh trước và cánh sau màu vàng nâu. Sải cánh: 95-100mm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1995, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Hypolimnas', NULL, 'GEN_0931', 'hypolimnasbolina', 'Hypolimnas bolima', '(Linnaeus, 1758)', 'Bướm cánh rộng', 'SPA_02002', 'Kích thước tương đối lớn và dễ nhận diện.Mặt trên con đực có màu nền đen với mảng ở giữa cánh dạng \"quả trứng\" trên cả 4 cánh, ở chót cánh trước có một đốm trắng to và có một loạt các chấm trắng rất nhỏ chạy dọc theo gần mép ngoài của cả cánh trước lẫn cánh sau, con cái lớn hơn con đực. Bướm cái và bướm đực rất khác nhau về màu sắc và hoa văn trên cánh. Một số dạng có đốm hoa nhuốm màu xanh sẫm nhưng một số khác lại không có những đốm hoa này Gặp khắp nơi, thường thấy ở khu vực có cây bụi, những khoảng trống trong rừng, ven đường mòn; trong thành phố hay gặp ở những bãi trống có cây chủ. Con đực có tập tính bảo vệ lãnh địa, thường đậu trên một cành cây chìa ra ở một khoảng trống và đánh đuổi các con bướm khác bay vào khu vực của nó. Sâu ăn lá rất nhiều loại cây khác nhau thuộc họ Khoai lang. Trứng có khi được đẻ thành từng đám, chồng lên nhau. Sâu màu đen với các gai phân nhánh, đầu màu cam. Nhộng  màu nâu đen loang lổ, nguỵ trang dạng một mẩu lá héo hay cành khô. Loài này thường di cư. Cả bướm đực và cái bay gần rừng phục hồi thứ sinh và khu đất canh tác, chúng thường hút mật hoa. Những cây thức ăn khác thuộc các họ Rau rền và họ Khoai lang.', NULL, 'Phổ biến trên toàn lãnh thổ Việt Nam Phân bố từ Đông châu Phi và Madagasca, qua các đảo trên Ấn Độ Dương và Ấn Độ đến Đông nam châu Á, Tân Ghi-nê và Australlia, phía Bắc đến Trung Quốc và các đảo phía Nam Nhật Bản', NULL, NULL, 'Là loài bướm đẹp, có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
(1996, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Hypolimnas', NULL, 'GEN_0931', 'hypolimnasmisippus', 'Hypolimnas misippus', 'Linnaeus, 1764', NULL, 'SPA_02003', 'Mặt trên của con đực có màu đen tím với một mảng lớn màu trắng ở mỗi cánh. Hình dạng phổ biến nhất của con cái là màu cam ở trên; cánh trước có vùng đỉnh màu đen được phân chia bởi một dải đốm trắng, cánh sau có một dải viền màu đen. Con cái màu cam bắt chước loài bướm châu Phi, Danaus chrysippus .', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'butterfliesandmoths.'),
(1997, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Junonia', NULL, 'GEN_0986', 'junoniaalmana', 'Junonia almana almana', 'Linnaeus, 1758', NULL, 'SPA_02004', 'Một trong những loài bướm phổ biến nhất của chi Junonia. Bướm trưởng thành có sải cánh dài 54–62 mm (2,1–2,4 in). Mặt trên màu cam với hai đốm mắt lớn ở cánh trước và sau, bờ cánh trước có những vạch đen. Viền cánh sậm màu và có các đường ren. Mặt dưới cánh thay đổi theo mùa. Dạng mùa mưa các đốm mắt rõ ràng; ở dạng mùa khô các đốm mắt tiêu giảm, chót cánh trước và góc ngoài cánh sau kéo dài ra trông giống lá khô, giúp loài này ngụy trang rất tốt. Con đực và con cái giống nhau. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'vi.wikipedia.org'),
(1998, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Junonia', NULL, 'GEN_0986', 'junoniaatlites', 'Junonia atlites atlites', '(Linnaeus, 1763)', NULL, 'SPA_02005', 'Đặc điểm nhận dạng:\n\nKhông thể nhầm lẫn vì có màu nền xám trắng trong vùng đĩa cánh và các đốm mắt chạy dọc mép tất cả các cánh, một số đốm lớn nửa cam nửa đen, có các đường vạch xám đen chạy ở viền cánh và ô cánh trước. Con đực và cái giống nhau. Giống như các loài bướm hoa khác, loài bướm này có hai dạng tuỳ theo hình dạng của cánh và mẫu hoa văn mặt dưới cánh. Sải cánh: 55-65mm.\n\nSinh học sinh thái:\n\nRất phổ biến ở các khu đô thị. Tập tính và nơi gặp tương tự J.almana. Được ghi nhận đẻ trứng trên giống cây Đinh lịch (Hygrophilalancea), họ Ô rô (Acanthaceae). Đôi khi bướm cái không đẻ trứng trên cây chủ mà trên một cành khô, một  cái lá héo hoặc một giá thể nào khác ở gần cây chủ. Sâu non sau khi nở ra hoặc mới nở bò sang cây chủ để ăn lá. Chúng xuất hiện ở những sinh cảnh tương tự loài J.almana', NULL, 'Từ Ấn Độ đến Trung Quốc, Thái Lan, Lào, Malaixia, và Việt Nam. Phân bố Toàn Việt Nam. Là loài có thể nói là phổ biến nhất trong số các loài thuộc giống Junonia - rất thường gặp và dễ thu bắt.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1999, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Junonia', NULL, 'GEN_0986', 'junoniahierta', 'Junonia hierta', '(Cramer, 1779)', '  ', 'SPA_02006', 'Mặt trên của con đực có màu vàng sáng. Xương cánh trước có hình tam giác rộng màu đen tuyền hướng xuống dưới ở các tế bào đĩa, và mặt lưng có hình tam giác hướng lên trên gần hình xoắn; rìa màu đen này thu hẹp lại gần giữa các đốt và trên đỉnh có hai vệt trắng ngắn nằm ngang trước đỉnh được các đường gân đen cắt ngang. Bên dưới đây là một con bạch cầu mờ đôi khi không có. Nửa trước và rìa cuối của cánh sau có màu đen, phần lưng có màu nâu trong khi vùng đen phía trước có một đốm lớn màu xanh lam rực rỡ. Lông mao của cả cánh trước và cánh sau có màu trắng xen kẽ màu nâu.\nMặt dưới cánh trước có màu vàng nhạt. Ô được cắt ngang bởi ba vạch màu vàng cam viền đen ở phía ngoài, phía sau là một dải xiên ngắn, rộng, màu đen tuyền không đều từ sườn đến gốc gân 4. Cánh sau màu vàng xám, về mùa khô có dạng bị nhiễm xạ mạnh (rắc) vảy sẫm màu. Với một dải đĩa đệm nằm ngang màu nâu nổi bật, các mép của nó rất ngoằn ngoèo. Có một dải màu nâu rộng ở giữa các đầu mối và một số vết hình mặt trăng mờ ở vùng đáy. Râu nhạt, đầu, ngực và bụng có màu nâu đen; bên dưới đó là màu trắng đục xỉn. \nCon cái cũng tương tự, mặc dù màu sắc xỉn hơn. Tế bào của mặt trên của cánh trước có một lớp màng ngang màu đen gần như hoàn chỉnh và một lớp khác ở các tế bào đĩa. Một mắt kính được đánh dấu rõ ràng ở giữa màu xanh lam nằm ở các khoảng trống 2 và 5 trên đĩa của cánh trước, và các mắt kính nhỏ hơn ở các khoảng trống 2 và 5 trên đĩa của cánh sau. Cánh trước và cánh sau có đường dưới màu nhạt khá rõ ràng, mặc dù đốm xanh trên vùng đen phía trước ở cánh sau nhỏ và không rõ ràng; phần còn lại là như nam giới. Mặt dưới cũng giống con đực nhưng nhìn chung có những mảng đậm hơn và rõ ràng hơn', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2000, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Junonia', NULL, 'GEN_0986', 'junoniaiphita', 'Junonia iphita iphita', '(Cramer, 1779)', 'Bướm Màu SooLôla', 'SPA_02007', 'Giống Junonia còn có tên gọi là Precis, gồm những loài bướm nhỏ hoặc kích thước trung bình. Các cánh thường có góc nhọn. Mặt trên có nhiều dạng màu sắc nhưng thường có mắt rõ nét. Có sự thay đổi màu sắc theo mùa. Loài J.iphita là loài lớn nhất trong giống Junonia. Mặt trên cánh có màu nâu với các vùng sậm màu hơn chạy dọc mép cánh. Mặt trên cánh sau có một hàng mắt nhỏ chạy dọc bên trong một dải màu đen sát mép ngoài cánh. Con đực màu sậm hơn con cái. Mặt dưới sậm màu hơn, thường có một hoặc hai đốm trắng ở bờ trước cánh sau. Vùng mép cánh trước nâu nhạt hơn - có những đường sáng chạy qua từ giữa mép trên đến góc dưới. Giống như các loài bướm hoa khác, bướm có hai dạng. Sải cánh: 55 - 80mm. Hay gặp ở rừng già và rừng thứ sinh nơi có độ cao thấp, cây bụi ven đường, cả trong rừng lẫn thành phố. Khó lại gần. Chúng thích thảm thực vật thứ sinh gần cửa rừng và những khoảng trống trong rừng ở chỗ thấp. Bướm cái đẻ trứng trên cây Chàm mèo Strobilanthes cusia, Thanh táo Justicia gendarussa và những cây khác thuộc họ Ô rô Acanthaceae.', NULL, ' Phổ rộng ở hầu khắp các quốc gia từ Sikkim, Nam Trung Quốc, Đài Loan, Thái Lan, Lào đến Malaisia, Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(2001, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Junonia', NULL, 'GEN_0986', 'junonialemonias', 'Junonia lemonias lemonias', '(Linnaeus, 1758)', NULL, 'SPA_02008', 'Loài này có màu nâu với nhiều đốm mắt cũng như các đốm với các vân màu đen và vàng chanh ở mặt trên của cánh. Mặt dưới có màu nâu xỉn, với các vân lượn sóng và các đốm có màu nâu và đen khác nhau. Ngoài ra còn có một đốm mắt ở đáy cánh trước. Các dạng mùa mưa và mùa khô khác nhau đáng kể về màu sắc và hình dạng. Ở dạng mùa mưa, các hoa văn rất rõ ràng và sặc sỡ và hình dạng cánh tròn hơn một chút. Ở dạng mùa khô, các hoa văn mờ và nhạt, đặc biệt là ở mặt dưới và mép cánh có nhiều góc cạnh và lởm chởm hơn. Điều này giúp bướm ngụy trang trong lớp lá khô.\nBướm hoa nâu là một loài bướm rất năng động và có thể được nhìn thấy đang phơi nắng với đôi cánh mở rộng hướng về phía mặt trời. Loài này nằm rất thấp so với mặt đất và có thể tiếp cận dễ dàng. Khi kiếm ăn, J. lemonias sẽ tìm kiếm thức ăn với một đôi cánh mở một nửa. Loài này bay khá khỏe và bay gần mặt đất với nhịp đập cánh nhanh và thường quay lại vị trí cũ. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'vi.wikipedia.org'),
(2002, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Junonia', NULL, 'GEN_0986', 'junoniaorithya', 'Junonia orithya ocyale', '(Hubner, [1819])', '', 'SPA_02009', 'Mặt trên: màu nền cánh trước là màu đen có ánh tím và hai đốm mắt gần tròn nằm gần viền ngoài cánh vùng M1 và một đốm có màu viền đỏ không rõ. vùng mép cánh. Cánh sau có màu  tím sẫm và cũng có hai đốm mắt một đồm nằm ở vùng Cu1 khá tròn có viền đỏ rất rõ đốm còn lại gần như là một màu tím đen đồng nhất. Mặt dưới cánh màu vàng nhạt với nhiều đốm kéo dài thành vệt. Bướm đực khác bướm cái có kích thước lớn hơn màu sắc không có màu xanh ngọc như con đực mà chủ yếu là màu nâu xỉn với các đốm mắt rất rõ. Đây là loài bướm nhỏ nhất trong giống Junonia sp. Loài này sống khá phổ biến ở các khu rừng khộp và các khu rừng thường xanh ở độ cao thấp. Thức ăn của sâu non là một số loài cây Hygrophila phlomoides, Ipomoea batatas, Thunbergia alata và một số loài thuộc họ Ô rô Acanthaceae là cây thức ăn của sâu non loài này. Sâu non trưởng thành có kích thước 35 - 40mm và sống thành bầy', NULL, 'Việt Nam chúng phần bố ở hầu khắp các tỉnh phía Nam như Đồng Nai, Tây Ninh, Bình Phước, Bà Rịa – Vũng Tàu Cambodia và Thái Lan.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(2003, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Kallima', NULL, 'GEN_0989', 'kallimaalbofasciata', 'Kallima albofasciata', 'Moore, 1877', '', 'SPA_02010', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2004, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Kallima', NULL, 'GEN_0989', 'kallimacanace', 'Kallima canace', NULL, NULL, 'SPA_02011', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2005, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Kallima', NULL, 'GEN_0989', 'kallimainachus', 'Kallima inachus', '(Doyère, 1840)', 'Bướm Lá Khô ', 'SPA_02012', 'Loài bướm rất đặc trưng cho việc bắt trước để ngụy trang lẩn tránh kẻ thù, khi chúng đậu khép cánh lại, mặt dưới cánh giống hệt như một chiếc lá khô. Với phần đuôi cánh sau kéo dài như một chiếc cuống lá và một đường màu nâu kéo dài đến chóp cánh trước tạo thành như gân chính của chiếc lá. Mặt trên cánh trước có một mảng màu cam ở giữa cánh, chóp cánh có màu đen với một chấm trắng nhỏ, phần còn lại cuả cánh trước và cánh sau có màu xanh lam rất rõ. Tuy nhiên ở sát mép và mép trên cánh sau có nền nâu vàng với những vẩy xanh lam li ti rải rác. Ở mặt trên cánh trước có một chấm trắng nhỏ nữa nằm ở vùng xanh lam, giữa cánh gần rơi mép mảnh màu cam. Ở sau phần giữa cánh về phía mép ngoài của cả cánh trước và cánh sau có một đường mảnh màu đen, lượn sóng. Con cái: phía trên đỉnh của cánh trước kéo dài và nhô ra. Mặt trên: con đực: màu xanh tím hoặc màu xanh nhạt phụ thuộc vào từng mùa. Sải cánh: 85 - 110 mm. Loài này chỉ sống trong các khu rừng thường xanh có nhiều cây to và thường gặp những cá thể đơn lẻ trong các bụi cây Calamus rậm rạp thuộc họ Cau (Arecaceae), đôi khi thấy chúng hấp dẫn bởi một số loài quả thối thuộc giống Ficus sp. Khi bị động chúng bay lên rất cao và sâu vào các bụi rậm, do cánh của chúng rất giống với một chiếc lá khô nên rất khó quan sát. Thức ăn của sâu non được ghi nhận là trên một số cây Song, mây Calamus thuộc họ Cau Arecaceae và cây Strobilanthes sp..    ', NULL, 'Việt Nam: gặp nhiều vào tháng 6,7 ở rừng nguyên sinh và thứ sinh liền kề với rừng nguyên sinh ở những khu rừng đất thấp, ở VQG Cúc Phương, Tam Đảo, Ba Vì gặp rất nhiều loài này vào dịp cuối tháng 6 đầu tháng 7 (dương lịch). Loài này còn gặp ở Đồng Nai, Lâm Đồng Nam Trung Quốc, Thái Lan, Lào', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(2006, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Kaniska', NULL, 'GEN_0993', 'kaniskacanace', 'Kaniska canace', 'Linnaeus, 1763', NULL, 'SPA_02013', 'Đặc điểm nhận dạng:\n\nBướm đực và cái giống nhau. Chúng thích những nơi bìa rừng có nắng và trống trải gần các con suối và sông. Bướm đực có một lãnh thổ riêng, ở đó chúng bay tuần tra và hay tấn công đuổi loài bướm khác. Bướm thích hút dịch cây và quả thối rữa. Với đôi cánh úp lại nhìn chúng giống như chiếc lá khô đen. Sâu non ăn lá cây Kim cang (họ Kim cang). Smilax elegantissima, Heterosmilax japonica thuộc họ Khúc khắc Smilacaceae và ở Trung quốc sâu non ký chủ trên cây Lilium lancifolium', NULL, 'Phân bố rất rộng từ Viễn Đông Nga qua Trung Quốc, Triều Tiên và Đông Dương đến Sunderland, phía Tây đến Ấn Độ và Srilanca. Đây là loài khá phổ biến ở miền Bắc và Trung của Việt Nam. Tên bướm được đặt vì có vạch xanh trên cánh.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2007, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Laringa', NULL, 'GEN_1030', 'laringahorsfieldi', 'Laringa horsfieldi glaucescens', '(de Nicéville, 1895)', '', 'SPA_02014', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2008, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Lasippa', NULL, 'GEN_1034', 'lasippaheliodore', 'Lasippa heliodore', '(Fabricius, 1787)', NULL, 'SPA_02015', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2009, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Lasippa', NULL, 'GEN_1034', 'lasippatiga', 'Lasippa tiga camboja', '(Moore, 1879)', '', 'SPA_02016', 'Mặt trên của loài có màu đen với các dải rộng màu cam. Màu nền ở mặt dưới là màu vàng cam với các dải màu xám đậm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'nparks.'),
(2010, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Lasippa', NULL, 'GEN_1034', 'lasippaviraja', 'Lasippa viraja', '(Moore, 1872)', NULL, 'SPA_02017', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2011, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Lebadea', NULL, 'GEN_1039', 'lebadeamartha', 'Lebadea martha', '(Fabricius, 1787)', 'Bướm Hiệp Sỹ ', 'SPA_02018', 'Giống Lebadea cũng có một loài với các loài phụ khác nhau trong khu vực Đông Nam Á. Kiểu màu sắc trên cánh rất khác nhau với các loài khác tương tự Moduza procris,  nhưng nền màu sáng hơn và khác biệt rõ rệt bởi dãy đốm trắng tạo thành băng ở hai cánh khá hẹp, đồng thời phần chót cánh trước thuôn dài, hơi uốn ra ngoài và phớt trắng. Màu nền mặt trên cánh đỏ nâu đằm thắm, ngoài các dải đốm màu trắng ra còn có các hàng chấm và đường màu đen, chạy song song với mép ngoài các cánh và gốc các cánh, các mép cánh ánh màu xanh lục. Ở con cái, chót cánh trước ít uốn cong ra hơn và không trắng rõ như ở con đực, đồng thời dải băng trắng trên cánh hẹp hơn so với con đực, kích thước to hơn con đực. Sải cánh: 60-65mm. Khá phổ biến nhưng chỉ xuất hiện từng cá thể, thường gặp dưới tán rừng thứ sinh, dọc đường mòn, gặp ở cả khu vực gần thành phố, nơi có các trảng cây bụi. Thuộc dạng khó lại gần. Có tập tính bảo vệ lãnh địa. Phân bố ở độ cao dưới 1.200m, trong các khu rừng thứ sinh và ở độ cao dưới 700m còn gặp ở các khu rừng nguyên sinh.', NULL, 'Đây là loài phổ biến khắp nơi ở Việt Nam. Phân bố từ Ấn Độ đến Trung Quốc và Philippin,  phía Nam đến quần đảo Sunda new Ghine và quần đảo Salomon.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(2012, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Lexias', NULL, 'GEN_1074', 'lexiasalbopunctata', 'Lexias albopunctata', '(Crowley, 1895)', 'Bướm đen hai chấm trắng', 'SPA_02019', 'Bướm có kích thước lớn, mặt trên cánh của con đực có màu nâu đen thẫm với những đốm màu vàng, trắng, xanh ngọc ngằm rải rác không đồng nhất trên mặt cánh. ở phía chót cánh có 2 đốm màu trắng khá to, rất rõ. Mặt dưới cánh có màu nâu nhạt với nhửng đốm màu trắng nhỏ trên cánh (cánh trước nhiều hơn cánh sau) và phần chót cánh củng có hai đốm màu trắng. Vòi hút màu đỏ đậm. Con cái lớn hơn con đực và cái đốm màu trên cánh là màu trắng Loài này có thân hình chắc, khoẻ, bay rất nhanh khi bị kích động, xuất hiện vào mùa mưa hàng năm và chúng thường hút dịch các loài quả chín rụng trong rừng.  Màu của chúng rất giống với màu thảm mục thực vật trong khu vực tìm kiếm thức ăn nên rất khó quan sát. Khi bị phát hiện chúng bay nhanh, tiếng đập cánh nghe rõ', NULL, 'Phân bố khắp Việt Nam Cambodia và Thái Lan và lục địa Đông nam châu Á', NULL, NULL, 'Có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
(2013, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Lexias', NULL, 'GEN_1074', 'lexiascyanipardus', 'Lexias cyanipardus albopunctata', '(Crowley, 1895)', '', 'SPA_02020', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2014, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Lexias', NULL, 'GEN_1074', 'lexiasdirtea', 'Lexias dirtea bontouxi', '(Vitalis de Salvaza, 1924)', '', 'SPA_02021', 'Giống Lexias trước kia được xếp vào giống Euthalia. Lexias dirtea là một trong những loài có kích thước lớn trong họ Bướm giáp Nymphalidae. Con đực và cái khác nhau, là loài dị hình. Con đực có mặt trên cánh đẹp một cách khỏe khoắn và khiêm tốn: gần mép và mép ngoài cánh trước màu đen xanh lục; nửa ngoài và mép ngoài cánh sau xanh dương với một hàng chấm gần mép và mép màu đen ánh xanh lục nhạt. Phần còn lại về phía gốc cánh trước và sau có màu đen với các chấm nhỏ cam đỏ, trắng rải thưa thớt dọc theo mép trên cánh. Con cái lớn hơn con đực có màu nền đen với các dải chấm nhiều màu sắc rải đều theo nhiều hàng lối trên cả 4 cánh, khi nhìn vào có cảm giác như các chuỗi hạt ngọc lung linh. Cả con đực và cái thuộc loài này rất giống với một loài khác là Bướm Giáp ngọc lớn chót râu cam đỏ đen Lexias pardalis. Hai loài này cũng phân bố chung ở một số khu vực nên khó phân biệt bằng cách quan sát. Đặc điểm đáng tin cậy nhất để phân biệt hai loài là chót râu phía ngoài của loài Lexias dirtea màu sậm gần như đen, trong khi đó ở Lexias pardalis là màu cam đỏ. Nửa ngoài cánh trước con cái L.dirtea có những đốm trắng to được bài trí gần với mép trên của cánh. Ở con đực Lexias dirtea và con đực cũng như con cái của loài Lexias pardalis không có các đốm trắng lớn như vậy ở cánh trước mà chỉ có những chấm nhỏ đều nhau màu trắng ngà hoặc vàng sáng. Sải cánh: 80 -105mm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.'),
(2015, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Lexias', NULL, 'GEN_1074', 'lexiaspardalis', 'Lexias padalis', 'Moore, 1878', NULL, 'SPA_02022', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2016, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Libythea', NULL, 'GEN_1078', 'libytheageoffroyi', 'Libythea geoffroyi', '(Godart, 1819)', '', 'SPA_02023', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2017, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Libythea', NULL, 'GEN_1078', 'libytheamyrrha', 'Libythea myrrha', '(Godart, 1819)', '', 'SPA_02024', 'Đặc điểm nhận dạng:\n\nLoài bướm có kích thước nhỏ, đặc điểm cơ bản là góc chót cánh trước bị cắt cụt thẳng và mịn. Màu sắc thay đổi, từ các điểm trang trí có thể thay đổi từ cam đến vàng, ở các đuờng viền hay màu nền mặt dưới. Đặc trưng của loài là màu nền ở mặt trên nâu tối, theo sau là các điểm trang trí vàng, da cam. Mặt trên cánh trước có 4 đốm vàng dạng hạt gạo trong đó hai đốm dính vào nhau làm thành hai cụm xếp so le ở vùng gần chót cánh trước, và có một dải dài màu vàng sẫm chạy từ gốc cánh ra vùng ô cánh có dạng nụ hoa quỳnh sắp nở trông rất ấn tượng. Cánh sau: có một băng vàng rộng chạy ngang giữa cánh từ mép trong thẳng tới góc trên cánh. Sải cánh: 45-55mm.\n\nSinh học sinh thái:\n\nPhân bố ở mọi độ cao, trong các trảng cỏ, bụi cây. Tuy nhiên là loài khá hiếm gặp. Thức ăn của sâu non là cây Cơm nguội rừng Celtis tetrundra thuộc họ Du Ulmaceae', NULL, 'Ấn Độ, Trung Quốc, Thái Lan, Lào, Xrilanka, Malaixia, Việt Nam, Brunei, Inđônêxia, Philippin.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2018, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Libythea', NULL, 'GEN_1078', 'libytheanarina', 'Libythea narina', '(Godart, 1819)', '', 'SPA_02025', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2019, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Limenitis', NULL, 'GEN_1080', 'limenitisdaraxa', 'Limenitis daraxa', '(Doubleday, [1848])', '  ', 'SPA_02026', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2020, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Limenitis', NULL, 'GEN_1080', 'limenitiszulema', 'Limenitis zulema', 'Doubleday.', NULL, 'SPA_02027', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2021, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Moduza', NULL, 'GEN_1243', 'moduzaprocris', 'Moduza procris procris', '(Camer, [1777])', NULL, 'SPA_02028', ' Mặt trên màu nâu đỏ với các đốm trắng to, nhỏ, dày, mỏng khác nhau xếp thành băng như chuỗi hạt bưởi chạy từ phần giữa cánh trước xuống cánh sau. Gần chót cánh trước có vài đốm trắng. Mặt dưới có các đốm trắng tương tự mặt trên, gốc cánh trắng hơi xanh. Ngoài màu nền nâu đỏ và các đốm, băng màu trắng, trên bề mặt cánh còn có nhiều hàng chấm đen ở giữa và sát mép cánh đồng thời có nhiều hoa văn màu đen mảnh mai ở phần gốc cánh. Tất cả các màu trên cánh đều nổi trội. Bướm đực và bướm cái giống nhau về kích thước và tập tính. Sải cánh: 55-75mm. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'UBND tinh Bac Kan'),
(2022, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptisananta', 'Neptis ananta', 'Moore, 1857', NULL, 'SPA_02029', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2023, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptiscartica', 'Neptis cartica', 'Moore, 1872', NULL, 'SPA_02030', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2024, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptisclinia', 'Neptis clina', 'Moore, 1872', 'Bướm cánh sọc trắng', 'SPA_02031', 'Mặt trên: màu đen với những điểm trang trí màu trắng. Cánh trước có vệt hình ngọn đuốc xuất phát từ gốc đến vùng giữa sát mép ngoài cánh, có một loạt các điểm trắng ở vùng giữa gần mép cánh nhưng không có ở khoảng 4, các đốm còn lại hướng ra viền trên cánh. Ở cánh sau, từ vùng giữa cánh trở ra hình thành một dải các đốm, kết thúc ở gân 7. Loài này giống như loài trên nhưng nhỏ hơn và mặt dưới màu đất nâu, không có đường viền tối màu trên các đốm. Ở khía cạnh khác nó giống như N.hylas, nhưng vùng lông mao ở khoảng 6,7 không có khoảng sáng. Mặt dưới: màu nâu đỏ tối, có các đường trang trí mờ với những màu tối hơn. Bướm đực và bướm cái như nhau. Sải cánh: 45-50mm Đây là loài tương đối phổ biến ở bìa rừng và đám bụi cây, chủ yếu ở độ cao vừa và thấp trong các trảng cỏ, bụi cây và khi xuống thấp dưới 700m còn bắt gặp chúng sống trong các khu rừng. Cây thức ăn của sâu non là Trắc thuộc họ Đậu', NULL, 'Gặp mọi nơi ở Việt Nam Vùng phân bố từ Tây Trung Quốc, Đông Nam Ấn Độ, lục địa Đông nam châu Á, phía Nam đến Sumatra, Borneo, Java, và Philippin', NULL, NULL, 'Là loài bướm đẹp, có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
(2025, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptisharita', 'Neptis harita', '(Moore, 1875)', NULL, 'SPA_02032', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2026, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptishordonia', 'Neptis hordonia', 'Stoll, 1790.', '', 'SPA_02033', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2027, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptishylas', 'Neptis hylas kamarupa', '(Moore, 1874)', '', 'SPA_02034', 'Neptis là giống khó phân biệt đến cấp loài bằng quan sát, đặc biệt trong rừng vì có nhiều loài tương tự nhau. Neptis hylas là loài phổ biến nhất. Cánh hẹp. Mặt trên đặc trưng cho giống Neptis với màu nền đen và các đốm, vệt trắng tạo thành các băng. Mặt dưới tương tự mặt trên, nhưng màu nền nâu gạch (đặc điểm nhận diện của loài này). Bướm cái lớn hơn một chút. Cả bướm đực và cái có kiểu bay lướt chậm khá gần mặt đất. Sải cánh 50-60mm. Sống ở tất cả các kiểu sinh thái và trong mọi môi trường. Nhiều loài thuộc giống Neptis chủ yếu gặp ở trong rừng, hay gặp ở rừng gỗ thứ sinh, dọc đường mòn, bay thấp. Neptis hylas có cách bay đặc trưng cho giống bướm này: đập cánh vài lần liên tục rồi xoè cánh ra và lượn một đoạn ngắn. Neptis hylas rất phổ biến, ngay cả trong thành phố. Sâu ăn lá nhiều họ cây khác nhau như cây họ Đậu Fabaceae, họ Bông Malvaceae, họ Đay Titiaceae. Có thể dễ dàng gặp loài này ở gần thảm thực vật thứ sinh, dọc đường và suối ở những độ cao khác nhau. Sâu non ăn lá cây Đậu dao, Sắn dây họ Đậu Fabaceae, Dướng Broussonetia papyrifera họ Dâu tằm Moraceae.Còn có các cây thức ăn khác như: Oobus vernus, Desmodium heterocarpon, Pteroloma triguetrum.', NULL, 'Xuất hiện mọi nơi ở Việt Nam.  Phân bố từ Srilanca và bán đảo Ấn Độ qua lục địa Đông Nam Á đến Trung Quốc và Nhật Bản, phía Nam đến Suntheland. ', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(2028, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptisleucoporos', 'Neptis leucoporos', 'Fruhstorfer, 1908.', NULL, 'SPA_02035', ' Trên cả hai cánh, các tế bào đều mở và gân số 8 ở cánh sau kết thúc trên bờ. Phía trên , các cánh có màu nâu sẫm đến đen với các mảng màu trắng như ở loài Athyma spp. Trên cánh trước có một vệt tế bào với một đốm hình tam giác nằm phía ngoài. Các điểm sau đĩa trong không gian 2 và 3 nằm trong cấp độ. Dải đĩa ở cánh sau không chạm tới sườn. Bên dưới , các cánh có màu nâu xám với các vết tương tự như ở mặt trên. Cánh sau có một vệt dưới nền đi qua đáy tế bào và tiếp tục bên dưới tĩnh mạch 8, và một vệt nền chạy dọc theo sườn nhưng không đến tĩnh mạch 8. Phần lưng của bụng có một dải nhỏ màu trắng thẳng hàng với dải đĩa đệm của cánh sau.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2029, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptismagadha', 'Neptis magadha annamitica', '(Fruhstorfer, 1908)', '', 'SPA_02036', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2030, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptismiah', 'Neptis miah', 'Moore, 1858', NULL, 'SPA_02037', 'Bướm cái và bướm đực giống nhau. Mặt trên: màu đất son với các sọc vàng cam rất nổi trội trên cả 4 cánh. Loài này rất giống với Pantoporia hordonia và Pantoporia sandaka nhưng chúng không có viền màu đỏ cam nằm ở viền mép cánh trước, nhưng xuất hiện thêm gân số 10 từ vùng trung tâm cánh. Vệt vùng trung tâm cánh trước được nối với một đốm ở phía xa. Lưu ý rằng, các đốm ở vùng gần rìa cánh trước ở khoảng 1a, 2 kết lại với nhau và ở khoảng 3, 4 gần dính vào nhau. Mặt dưới: có màu nâu xỉn và vệt màu nâu đỏ nhẹ, ở một vài vị trí có màu xanh. Sải cánh: 45-50mm.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan'),
(2031, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptisnarayana', 'Neptis narayana dubernardi', 'Map.', NULL, 'SPA_02038', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2032, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptisnata', 'Neptis nata gononata', '(Butler, 1879)', '', 'SPA_02039', 'Mặt trên có màu đen tuyền đậm; các vết màu trắng xanh, rất nổi bật và có các cạnh rõ ràng; lông mao xen kẽ với màu trắng. Cánh trước với vệt tế bào bị cắt cụt rộng rãi ở cuối, đốm tế bào rộng kéo dài đến một điểm nhọn; Một loạt các đốm cong hình đĩa có kích thước vừa phải, các đốm dưới đỉnh khá thon dài và hình bầu dục, bốn đốm dưới xiên thẳng, đốm trên nhỏ, hình bầu dục và nằm rất gần các lunus dưới rìa, hai đốm thấp nhất nhỏ nhất và hẹp, đốm thứ hai rộng. ; một hàng dưới mép gồm các đốm mặt trăng nhỏ màu trắng, hẹp nhất ở con cái, một đường nhạt hình sin mảnh khảnh ở dưới rìa bên trong và một đường mặt trăng mờ ở rìa. Cánh sau có dải đĩa đệm bên trong hơi hẹp, kết thúc ở tĩnh mạch dưới sườn trên và dải điểm vàng đĩa đệm bên ngoài hẹp hơn; một đường mặt trăng mảnh mai nhạt mờ ở đĩa trong và một đường chẵn ở rìa; Phần gốc của costa ở con đực có màu xám bạc rộng, bóng và có một mảng vảy màu xám xỉn hơn ở phía trong từ gân sườn đến phần dưới của xương quay. Mặt dưới màu nâu tía màu ô liu sẫm; các dấu hiệu như trên, nổi bật, tất cả đều có màu trắng xanh, ngoại trừ đường rìa bên trong và bên ngoài ở cánh trước, cũng như đường bên trong và đường biên ở cánh sau, cũng như hai vệt cơ bản của nó, có màu xám hoa cà', NULL, 'được tìm thấy ở Nam và Đông Nam Á ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Neptis_nata'),
(2033, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptisnemorum', 'Neptis nemorum', 'Oberthür, 1906', NULL, 'SPA_02040', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2034, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptisphaedyma', 'Neptis phaedyma columella martabana', ' (Moore, 1881)', '', 'SPA_02041', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
