(2036, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptisradha', 'Neptis radha', 'Moore, 1857', NULL, 'SPA_02043', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2037, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptissandaka', 'Neptis sandaka', '(Butler, 1892)', '', 'SPA_02044', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2038, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptissankara', 'Neptis sankara guiltoides', '(Tytler, 1940)', '', 'SPA_02045', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2039, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptissappho', 'Neptis sappho astola', '(Moore, 1872)', '', 'SPA_02046', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2040, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Neptis', NULL, 'GEN_1311', 'neptissoma', 'Neptis soma', 'Linnaeus, 1758', '', 'SPA_02047', 'Con đực và con cái, mặt trên có màu đen, có những vệt trắng hơi xỉn. Cánh trước: vệt hình đĩa hẹp, đỉnh cụt, có đốm hình tam giác ngoài hẹp, rất dài; các đốm đĩa đệm nhỏ, hình bầu dục, tách biệt rõ ràng; chuỗi đốm ngang sau đĩa đệm hoàn chỉnh. Cánh sau: dải dưới đáy rất hẹp, hơi gợn sóng; các đường nhợt nhạt ở đĩa đệm và dưới cực rất mờ; dãy đốm sau đĩa nằm ngang, rất hẹp, thường chỉ được biểu hiện bằng một dải nhạt. Mặt dưới màu nâu đỏ sô-cô-la, có các vết giống như mặt trên, nhưng rộng hơn và hơi lan tỏa. Cánh trước có sọc hình đĩa và đốm hình tam giác phía sau nó hợp sinh một cách lan tỏa (kết hợp với các vết khác), một số vết trắng tuyến tính nằm ngang ở hai bên của loạt đốm sau đĩa đệm; cánh phía dưới gân 1 màu nâu xám nhạt. Cánh sau: các vết nhợt nhạt ở đĩa đệm và phần dưới của mặt trên được thể hiện bằng các dải màu trắng, rất hẹp, được xác định rõ ràng hơn, ở con cái, có thêm một dải màu trắng tương tự ở cuối. Râu đầu màu đen; đầu, ngực và bụng đen kịt; bên dưới màu trắng sẫm. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
