(2049, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Pantoporia', NULL, 'GEN_1436', 'pantoporiaaurelia', 'Pantoporia aurelia', '(Staudinger, 1886)', NULL, 'SPA_02056', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2050, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Pantoporia', NULL, 'GEN_1436', 'pantoporiahordonia', 'Pantoporia hordinia', '(Stoll, 1790)', NULL, 'SPA_02057', 'Mặt trên cánh có màu nâu đen thẫm với những giải băng đốm màu vàng cam, dọc theo mép cánh trước có một dải màu đỏ cam chia làm hai khúc. Đỉnh chót cánh có màu trắng. Trên cánh trước có một băng hình con ốc vặn chạy từ gốc qua vùng trung tâm của cánh; hai dải băng còn lại ở vùng ô cánh, còn có một đường rất mảnh chạy theo gần mép ngoài cánh ôm lấy các dải vàng bên trong ô cánh. Trên cánh sau có hai dải rộng ở giữa cánh và một đường rất mảnh ở sát mép ngoài cánh. Mặt dưới cánh cũng gồm hai màu đen và vàng nhưng dọc theo mép cánh là dải băng màu đen sậm đứt khúc và có màu vàng nhạt và nâu nhạt. Khi đậu chúng thường xoè cánh và có kiểu bay rất giống với nhóm Bướm lính thủy Neptis. Sải cánh: 50mm.', NULL, 'Vùng phân bố từ Cambodia và Thái Lan và lục địa Đông nam châu Á. Loài này phổ biến khắp các cánh rừng ở Việt Nam. Bướm được đặt tên theo màu đen và băng màu cam trên cánh', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=3&ID=316'),
(2051, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Pantoporia', NULL, 'GEN_1436', 'pantoporiaparaka', 'Pantoporia paraka paraka', '(Butler, 1879)', '', 'SPA_02058', 'Ở con đực và con cái, mặt trên màu đen với các mảng màu vàng rộng. Cánh trước: vệt trong ô rộng hai lần thụt vào phía trước, kéo dài vào khoảng trống thứ 3 ở đỉnh; các đốm đĩa đệm phía sau dính vào nhau, các đốm xiên phía trước cũng dính vào nhau; một đường ngang nhạt màu sau đĩa đệm và một đường màu cam rất nhỏ, mờ ở phía dưới. Cánh sau: dải dưới đáy rộng và dải sau đĩa hẹp. Mặt dưới: các vạch màu vàng như mặt trên, nhưng rộng hơn và ít rõ ràng hơn; màu nâu hạt dẻ. Cánh sau với phần gốc phủ đầy hoa cà, các dải dưới đáy và sau đĩa được bao bọc bên ngoài bởi các dải hoa cà hẹp; lề cuối có một đường màu hoa cà mờ mịt. Thân trên, màu đen; bên dưới nhợt nhạt. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Indiabiodiversity'),
(2052, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Pantoporia', NULL, 'GEN_1436', 'pantoporiasandaka', 'Pantoporia sandaka davidsoni', '(Eliot, 1969)', NULL, 'SPA_02059', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2053, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Parasarpa', NULL, 'GEN_1462', 'parasarpadudu', 'Parasarpa dudu', '(Doubleday, 1848)', NULL, 'SPA_02061', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2054, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Parthenos', NULL, 'GEN_1480', 'parthenossylvia', 'Parthenos sylvia gambrisius martha', '(Fabricius, 1787)', '', 'SPA_02062', 'Một loài có kích thước lớn và không thể nhầm lẫn. Mặt trên cánh có màu xanh lam, viền cánh đen, các đốm vệt đen chạy khắp cánh và ngang thân tạo ra dạng vằn vện rất đặc thù. Cánh trước có một dãy đốm trắng lớn chạy dọc mép, từ gần gốc đáy cánh đến gần chót cánh. Mặt dưới sáng màu, trắng bạc phớt xanh. Con đực và cái giống nhau, con cái có kích thước lớn hơn. Bướm có kiểu bay lướt nhanh lạ thường. Giống Parthenos chỉ có một loài, phân bố rộng trên Thế giới từ Sri Lanka, Ấn Độ cho đến Tân Guinea và quần đảo Solomon; có nhiều loài phụ khác nhau với các kiểu màu sắc rất khác nhau. Loài phụ ở Việt Nam là P.sylvia gambrisius. Sải cánh: 85-100mm. Phổ biến nhưng không bao giờ gặp với số lượng lớn, cả trong rừng ở các độ cao khác nhau (thường thấy ven đường mòn) lẫn khu vực thành thị. Có cách bay rất đặc biệt: đập cánh nhanh vài lần rồi xoè cánh ra ở tư thế cụp xuống và lượn khá nhanh. Con đực có tập tính bảo vệ lãnh địa. Nó thường chiếm lĩnh một khu vực cạnh đường mòn, bay xuống đất hút chất khoáng ở gần đó, đánh đuổi mọi con bướm xâm nhập lãnh địa. Sâu ăn lá các loài dây leo như giống cây Thư diệp Adenia sp. thuộc họ Nhãn lồng Passifloraceae và dây Rễ gió Tinospora cordifolia thuộc họ Dây mối Menispermaceae. Có một vài thế hệ trong một năm, thế hệ mùa thu có số lượng nhiều hơn. Bướm trưởng thành hay gặp ở những vùng đất thấp, làng quê, trong vườn và công viên ở thành phố. Chúng bị hấp dẫn bởi một số loài thực vật có hoa như Bông ổi và Cỏ hôi. Sâu non sống ở trên cây Thư diệp Adenia sp. và  dây Ký ninh - Tinospora crispa. Loài không phổ biến. Sống ở mọi độ cao, trong các rừng thứ sinh, trảng cây, bụi cỏ, phổ biến ở các trảng cây bụi cỏ vùng thấp.', NULL, 'Phân bố toàn Việt Nam. Đông Ấn Độ, Mianma, Trung Quốc, Thái Lan, Lào, Malaixia, và Việt Nam. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(2055, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Penthema', NULL, 'GEN_1499', 'penthemabinghami', 'Penthema binghami', 'Riley, 1932', NULL, 'SPA_02063', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2056, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Penthema', NULL, 'GEN_1499', 'penthemadarlisa', 'Penthema darlisa annamitica', '(Fruhstorfer, 1907)', '', 'SPA_02064', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2057, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Phaedyma', NULL, 'GEN_1512', 'phaedymacolumella', 'Phaedyma columella martabana', '(Moore, 1881)', NULL, 'SPA_02065', 'Giống Phaedyma trước kia đã từng được xếp trong giống Neptis. Hiện nay giống này mới chỉ có một loài Phaedyma columella. Loài Phaedyma columella nhìn thoáng loài này gần giống với loài Neptis magadha nhưng khi quan sát kỹ thì loài này có mép trên cánh sau ở mặt trên cánh và mép dưới cánh trước ở mặt dưới cánh có màu xám trắng lan rộng cả vào ô cánh, còn ở loài Neptis magadha thì tất cả những nơi đó đều có chung màu với màu nền. Mặt trên: đen và trắng. Cánh trước có các đốm phần giữa gần với rìa ngoài cánh ở khoảng 2,3,5 và 6, và các đốm ở sát với mép ngoài cánh ở khoảng 2,4,5,6. Cánh sau có một dải giữa cánh, và một loạt các đốm ở giữa gần mép cánh. Mặt dưới: màu nâu đỏ nhạt ở dạng mùa mưa và màu nâu đất son ở dạng mùa khô. Sải cánh: 60-65mm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.'),
(2058, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Phalanta', NULL, 'GEN_1518', 'phalantaalcippe', 'Phalanta alcippe alcippoides', '(Moore, [1900])', '', 'SPA_02066', 'Các loài thuộc giống này thường có màu sắc như trên da báo. Bướm màu vàng cam tươi với những chấm và vệt đen khắp mặt trên của cánh trước và cánh sau trông như hoa văn của báo Hoa Mai. Loài này rất dễ nhầm với loài Enispe intermedia thuộc họ Amathusiidae. Mặt dưới bóng hơn mặt trên, con đực và con cái nhìn giống nhau, có các cá thể màu tía bóng nổi bật ở dạng mùa khô. Sải cánh: 40-45mm. Phalanta alcippe có kích thước nhỏ hơn Phalanta phalantha, màu nhạt hơn và hoa văn cũng không dày đặc. Loài này chủ yếu ở những vùng thấp và đồi gò. Chúng ưa thích nơi sống vùng làng quê nằm gần những nơi có những bụi hoa Thơm ổi Lantana camara. Bướm bay khá thấp gần mặt đất và bị hấp dẫn bởi các bụi hoa trồng ở công viên hay trong vườn nhà. Bướm cái đẻ trứng trên cây Kim quýt Triphasia trifolia thuộc họ Cam Rutaceae.', NULL, 'Xuất hiện mọi nơi ở Việt Nam. Phân bố rộng với số cá thể đông. Cũng đã phát hiện được loài này ở độ cao đến 1000m ở VQG Tam Đảo. Nam Á bao gồm cả Xrilanca và Mianma, từ Ấn Độ đến Nam Trung Quốc, Hồng Kông, Đông Dương và bán đảo Malaixia, phía Nam đến những đảo lớn của Indonesia. ', NULL, NULL, 'Là loài thường gặp và phân bố rộng khắp Việt Nam nên được xếp vào các loài thông thường.', NULL, NULL, NULL, 'Vncreatures'),
(2059, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Phalanta', NULL, 'GEN_1518', 'phalantaphalantha', 'Phalanta phalantha phalantha', '(Drury, [1773])', '', 'SPA_02067', 'Đôi cánh có màu nâu cam và có khá nhiều đốm đen và vệt. Mỗi cánh trước có hai vạch sẫm màu trong ô tạo thành một đốm ô không đều. Bên dưới, các cánh có màu cam nhạt hơn, chỉ có một số đốm và sọc đen, các vùng dưới rìa và sau đĩa đệm của cả hai cánh đều có ánh tím khi nhìn dưới ánh sáng bên. Những con trưởng thành bay nhanh thường được tìm thấy ở những nơi phát triển thứ cấp, khu đô thị, vỉa hè, công viên và vườn. Điều này có thể là do thực tế là hai cây ký chủ địa phương được biết đến đều được trồng ở những nơi này. Người ta có thể nhìn thấy những con trưởng thành bay nhanh đang bay xung quanh những bụi cây đang nở hoa để lấy mật hoa, và đôi khi có thể nhìn thấy một số con trong số chúng tụ tập với nhau trên mặt đất ẩm ướt. Những người lớn bồn chồn khiến các nhiếp ảnh gia khó có thể chụp được họ trên phim.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'greathimalayannationalpark'),
(2060, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Polygonia', NULL, 'GEN_1601', 'polygoniacaureum', 'Polygonia c-aureum', '(Linnaeus, 1758)', NULL, 'SPA_02068', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2061, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Polyura', NULL, 'GEN_1607', 'polyuraarja', 'Polyura arja', '(C. Felder & R. Felder) 1867', 'Bướm Giáp Nâu Xanh Nhạt ', 'SPA_02069', 'Bướm có kích thước 45 - 55mm. Loài này rất giống với Bướm giáp nâu xanh ấn độ Polyura athamas. Mặt trên cánh có màu nền nâu đen với một băng rộng màu xanh lơ chạy dài từ giữa cánh trước đến cánh sau. Gần chót cánh trước có 1 đốm màu xanh lơ lớn. Cánh sau có hai đuôi ngắn, nhọn, riềm cánh có một hàng chấm màu nâu viền trắng. bướm đực và bướm cái có thể dễ dàng gặp ở các khu rừng thứ sinh gần suối, bướm cái lớn hơn chút ít. Thân bướm rất mập, khoẻ, râu lớn, dài và có màu đen tuyền Bướm có cánh khỏe và bay nhanh. Chúng bị hấp dẫn bởi mùi quả thối, phân chim và động vật. Bướm tụ tập theo đàn lẫn với các loài bướm khác. Sống chung một sinh cảnh và bướm trưởng thành cạnh tranh thức ăn với Bướm giáp đen đốm vàng Polyura athamas. Bay rất nhanh. Tập tính và nơi gặp tương tự giống Charaxes. Đẻ trứng trên giống cây Sống rắn Albizzia chiensis, họ Đậu Fabaceae. Cả bướm đực và bướm cái có thể dễ dàng gặp ở rừng thứ sinh gần suối, bướm cái lớn hơn chút ít. Bướm có cánh khỏe và bay nhanh. Chúng bị hấp dẫn bởi mùi quả thối, phân chim và động vật. Bướm tụ tập theo đàn lẫn với các loài bướm khác. Bướm cái đẻ trứng trên một số cây thuộc họ Đậu Fabaceae như Bồ kết Gleditsia fera, Keo dậu Leucaena leucocephala và Lim vàng. Sống ở nhiều độ cao khác nhau trong các khu rừng tái sinh và đặc biệt phong phú ở các trảng cỏ, bụi cây có độ cao dưới 700m.', NULL, 'Loài này phổ biến khắp nơi ở Việt Nam. Bướm được đặt tên theo màu xanh và đốm nâu trên cánh. Vùng phân bố từ Ấn Độ và Srilanca qua Nam Trung Quốc và lục địa Đông nam châu Á đến Đài Loan và một số đảo thuộc quần đảo Sanda. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(2062, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Polyura', NULL, 'GEN_1607', 'polyuraathamas', 'Polyura athamas', 'Drury, 1773. ', 'Bướm Giáp Đen Đốm Vàng', 'SPA_02070', 'Giống Polyura có 10 loài ở Việt Nam, Polyura athamas là loài phổ biến nhất. Giống này có nhiều đặc điểm tương tự giống Charaxes, nhưng cánh sau có hai đuôi ngắn và kiểu màu sắc khác hẳn giống Charaxes. Mặt trên Polyura athamas màu đen với một vạch rộng màu vàng xanh lục hơi nhạt chạy ngang qua hai cánh. Mặt dưới tương tự mặt trên nhưng ở phía ngoài vạch xanh có các hoa văn phức tạp hơn mặt trên và màu nền nhạt hơn. Còn hình chiếu của mặt trên xanh lục thì ở mặt dưới xanh da trời nhạt và dải viền mép ngoài cánh sau màu nâu đỏ nhạt. Sải cánh: 60-70mm. Bay rất nhanh. Tập tính và nơi gặp tương tự giống Charaxes. Đẻ trứng trên giống cây Sống rắn Albizzia chiensis, họ Đậu Fabaceae. Cả bướm đực và bướm cái có thể dễ dàng gặp ở rừng thứ sinh gần suối, bướm cái lớn hơn chút ít. Bướm có cánh khỏe và bay nhanh. Chúng bị hấp dẫn bởi mùi quả thối, phân chim và động vật. Bướm tụ tập theo đàn lẫn với các loài bướm khác. Bướm cái đẻ trứng trên một số cây thuộc họ Đậu Fabaceae như Bồ kết Gleditsia fera, Keo dậu Leucaena leucocephala và Lim vàng. Sống ở nhiều độ cao khác nhau trong các khu rừng tái sinh và đặc biệt phong phú ở các trảng cỏ, bụi cây có độ cao dưới 700m.', NULL, ' Từ Sikkim tới Mianma, Trung Quốc, Thái lan, Lào, Malaixia, Indonesia, Philippin, Việt Nam.', NULL, NULL, 'Có thể nhân nuôi loài này trong các khu vườn bướm để làm công cụ học tập và tham quan cho học sinh, sinh viên nghiên cứu và học tập.', NULL, NULL, NULL, 'vncreatures.net'),
(2063, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Polyura', NULL, 'GEN_1607', 'polyuradelphis', 'Polyura delphis delphis', '(Doubleday, 1843)', 'Bướm giáp ngọc bích', 'SPA_02071', 'Bướm có kích thước trung bình, Con đực và con cái có màu sắc, hoa văn khác nhau. Sải cánh: 90 -110mm. Con đực có bờ cánh trước phẳng, ỡ ngọn mặt trên cánh trước có màu đen và ở giữa mảng đen có một đốm màu trắng. Bờ cánh sau nhô ra thành đuôi nhọn ở gần 2,3,4 và có các hàng đốm màu đen hình liềm. Mặt sau dưới cánh sau có hoa văn sặc sỡ màu cam nhạt hình liềm và màu nâu đỏ, đen nằm ở phần bờ cánh. Gần gốc ac1nh co một đốm đen to nằm sát gờ cánh. Mặt trên của con cái có nhiều hàng đốm màu trắng chạy dọc phần mép cánh máu đen và mặt cánh dưới cũng có một mảng đen nằm sát  mép ngoài cánh sau. Mặt dưới có nhiều dải màu nhạt chạy dọc theo cánh sau và phần nép cánh màu nhạt hơn phân trên cánh. Bay rất nhanh. Tập tính và nơi gặp tương tự giống Charaxes. Bướm cái đẻ trứng trên giống cây Sống rắn (Albizzia sp.), họ Đậu (Fabaceae). Cả bướm đực và bướm cái rất ít gặp ở rừng thứ sinh. Chỉ gặp ở rừng nguyên sinh còn tốt nơi gần suối. Bướm có cánh khỏe và bay nhanh. Chúng bị hấp dẫn bởi mùi quả thối, phân chim và động vật. Bướm tụ tập theo đàn lẫn với các loài bướm khác. Phân bố ở nhiều độ cao khác nhau trong các khu rừng còn tốt ở độ cao dưới 700m.', NULL, ' Từ Sikkim tới Mianma, Trung Quốc, Thái lan, Lào, Malaixia, Indonesia, Philippin, Việt Nam.', NULL, NULL, 'Là loài thường gặp và có phổ phân bố khá rộng. Có thể nhân nuôi loài này trong trang trại.', NULL, NULL, NULL, 'Vncreatures'),
