(2066, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Polyura', NULL, 'GEN_1607', 'polyurajalysus', 'Polyura jalysus', '(C. Felder & R. Felder, [1867])', '  ', 'SPA_02074', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2067, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Polyura', NULL, 'GEN_1607', 'polyuramoori', 'Polyura moori sandakana', '(Fuhstorfer, 1895)', '', 'SPA_02075', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2068, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Polyura', NULL, 'GEN_1607', 'polyuranepenthes', 'Polyura nepenthes', '(Grose-Smith, 1883)', NULL, 'SPA_02076', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2069, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Polyura', NULL, 'GEN_1607', 'polyuraschreiberi', 'Polyura schreiberi assamensis', '(Rothschild, 1899)', '', 'SPA_02077', 'Mặt dưới màu bạc được đánh dấu bằng các hoa văn màu nâu và tím. Mặt trên có dải giữa màu trắng được trang trí bằng màu xanh lam. Nó sở hữu một cặp đuôi ở hai cánh sau. Con cái của loài này thường lớn hơn với đuôi rộng hơn và dài hơn. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'National Parks Board'),
(2070, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Prothoe', NULL, 'GEN_1637', 'prothoefranck', 'Prothoe franck nausikae', 'Fruhstorfer, 1901', NULL, 'SPA_02078', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2071, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Pseudergolis', NULL, 'GEN_1645', 'pseudergoliswedah', 'Pseudergolis wedah', ' (Kollar, [1844])', NULL, 'SPA_02079', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2072, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Rhinopalpa', NULL, 'GEN_1733', 'rhinopalpapolynice', 'Rhinopalpa polynice birmana', '(Fruhstorfer, 1897)', '', 'SPA_02080', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2073, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Rohana', NULL, 'GEN_1758', 'rohananakuba', 'Rohana nakuba', 'Nguyen-Phung, 1985', NULL, 'SPA_02081', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2074, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Rohana', NULL, 'GEN_1758', 'rohanaparisatis', 'Rohana parisatis', '(Westwood, [1850])', '', 'SPA_02082', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2075, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Rohana', NULL, 'GEN_1758', 'rohanatonkiniana', 'Rohana tonkiniana', 'Fruhstorfer, 1906', '', 'SPA_02083', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2076, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Stibochiona', NULL, 'GEN_1862', 'stibochionanicea', 'Stibochiona nicea', '(Gray, 1846)', NULL, 'SPA_02084', 'Sải cánh khoảng 55mm. Mặt trên cánh màu đen, mặt dưới màu nâu. Có một hàng đốm trắng nhỏ gọn gàng ở mép ngoài của cánh trước, trong đó có 2 ở khoang 2a, một hàng đốm trắng nhỏ ở mép ngoài phụ và một đường màu xanh lam giữa 2 đốm trắng trên. . Có 3 đường ngắn màu xanh lam và trắng ở phòng giữa, một số đốm trắng nhỏ ở bên ngoài phòng giữa và một số đốm trắng nhỏ ở bên ngoài cánh sau. Có một dãy các đốm trắng ở mép ngoài của cánh sau, và một dãy các đốm đen và các dải xanh lam ở bên trong các đốm trắng. Thay vào đó, các đốm giống như mặt trước và rõ ràng hơn. Con cái nhỏ hơn con đực. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(2077, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Sumalia', NULL, 'GEN_1880', 'sumaliadaraxa', 'Sumalia daraxa', '(Doubleday, 1848)', NULL, 'SPA_02085', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2078, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Symbrenthia', NULL, 'GEN_1889', 'symbrenthiahypselis', 'Symbrenthia hypselis', 'Godart 1823', NULL, 'SPA_02086', 'Có 3 đường vân màu vàng ở mặt sau của cánh trước và sau, nhưng mặt bụng có màu đen và hình da báo màu vàng. Trên mặt bụng của cánh sau gần mép ngoài có 5 đường vân mắt. Màu sắc của bướm cái nhẹ hơn, và các vạch rộng hơn và tròn hơn. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(2079, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Symbrenthia', NULL, 'GEN_1889', 'symbrenthialilaea', 'Symbrenthia lilaea', '(Hewitson, 1864)', NULL, 'SPA_02087', 'Đây là một giống gồm các loài bướm rất nhỏ. Mặt trên màu nền đen với các dải màu vàng cam đỏ chạy ngang qua cánh. Kiểu màu sắc mặt trên cánh tương tự giống Pantoporia với màu nền đen và các băng ngang màu cam đỏ, tuy nhiên có thể phân biệt nhờ cánh sau có một đuôi ngắn. Cấu trúc cơ thể khác hẳn giống Pantoporia, với râu dài và thẳng, khối cơ vận động cánh phát triển, bay rất nhanh, khác hẳn cách bay chậm của giống Neptis, Pantoporia và Lasippa. Mặt dưới vàng cam loang lổ sáng màu, góc ngoài cánh sau có các vẩy hơi trắng. Bướm đực và bướm cái giống nhau, tuy nhiên bướm cái lớn hơn. Sải cánh: 40-55mm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2080, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Tanaecia', NULL, 'GEN_1910', 'tanaeciacocytus', 'Tanaecia cocytus', '(Fabricius, 1787)', 'Bướm Nâu Oải Hương ', 'SPA_02088', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2081, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Tanaecia', NULL, 'GEN_1910', 'tanaeciagodartii', 'Tanaecia godartii', '(Gray, 1846)', '  ', 'SPA_02089', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2082, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Tanaecia', NULL, 'GEN_1910', 'tanaeciajahnu', 'Tanaecia jahnu', '(Moore, [1858])', 'Bướm Nâu Miệt Vườn ', 'SPA_02090', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2083, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Tanaecia', NULL, 'GEN_1910', 'tanaeciajulii', 'Tanaecia julii', 'duc T.Saito & Vu, 2023.', NULL, 'SPA_02091', 'Trước đây các loài trong giống Tanaecia được xếp vào giống Euthalia. Việc tách biệt hai giống này dựa trên sự khác nhau của gân cánh trước. T.julli là loài phổ biến nhất trong giống này. Là loài lưỡng hình. Con đực rất dễ nhận diện mặt trên cánh màu nâu và có một vệt rộng màu xanh lục ở phía ngoài cánh sau. Con cái màu nâu nhạt, có các vân nâu sậm trên cánh và các đốm trắng không rõ mép ở gần chót cánh. Đây là kiểu màu sắc tương tự như con cái của nhiều loài trong giống Euthalia. Sải cánh: 65-80mm. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(2084, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Tanaecia', NULL, 'GEN_1910', 'tanaecialepidea', 'Tanaecia lepidea', '(Butler, 1868)', NULL, 'SPA_02092', 'Trước đây các loài trong giống Tanaecia được xếp vào giống Euthalia. Việc tách biệt hai giống này dựa trên sự khác nhau của gân cánh trước. Tanaecia julli là loài phổ biến nhất trong giống này. Là loài lưỡng hình. Con đực rất dễ nhận diện mặt trên cánh màu nâu và có một vệt rộng màu xanh dương ở phía ngoài cánh sau. Con cái màu nâu nhạt, có các vân nâu sậm trên cánh và các đốm trắng không rõ mép ở gần chót cánh. Đây là kiểu màu sắc tương tự như con cái của nhiều loài trong giống Euthalia.\nMột loài khác rất hay gặp chung với Tanaecia julii và cũng phổ biến là Bướm Giáp cánh liềm đuôi xám Tanaecia lepidea, có chót cánh trước uốn cong ra ngoài dạng lưỡi liềm, mép ngoài cánh trước và góc ngoài cánh sau viền xám nhạt. Loài Tanaecia cocytus tương tự Tanaecia lepidea, nhưng hiếm gặp hơn, kích thước nhỏ hơn, viền xám nhạt ở cánh sau rộng hơn, phần viền bạc ở cánh trước chỉ hiện diện ở góc ngoài cánh. Bướm cái lớn hơn và mặt dưới cánh sau có viền rộng và nhạt màu hơn. Sải cánh: 45-70mm. Thường gặp dưới tán rừng thứ sinh có cây gỗ nhỏ, cây bụi. Hay đậu dưới đất, trên lớp lá mục dưới tán rừng. Chúng bị hấp dẫn bởi trái cây mục rữa và những chất hữu cơ phân huỷ khác. Con đực có tập tính bảo vệ lãnh địa. Đôi khi có thể quan sát thấy \"chủ nhân\" đánh đuổi rất lâu một con đực khác, kéo dài hàng giờ nếu xâm nhập vào lãnh thổ của nó. Về tập tính chúng giống như các loài bướm khác nói trên như bướm đuôi xanh, bướm ăn quả thối. Tuy nhiên loài này thích nơi rừng bị chặt, nơi trống trải, cây bụi,ở độ cao vừa và thấp. Sâu non sống trên một số loài cây Mua bà Melastoma malabathricum thuộc họ Mua Melastomataceae và cây Vừng Careya arborea họ Lộc vừng Lecythidaceae.', NULL, 'có ở mọi nơi ở Việt Nam. Phân bố từ Ấn độ đến Mian-ma, Trung Quốc, Thái Lan, Malaixia và Đông Dương;', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(2085, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Tanaecia', NULL, 'GEN_1910', 'tanaeciamunda', 'Tanaecia munda', '(Fruhstorfer, 1899)', '', 'SPA_02093', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2086, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Tanaecia', NULL, 'GEN_1910', 'tanaeciapelea', 'Tanaecia pelea', 'Fabricius, 1787', '', 'SPA_02094', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2087, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Terinos', NULL, 'GEN_1930', 'terinosatliata', 'Terinos atliata militum', '(Oberthur, 1877)', '', 'SPA_02095', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2088, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Terinos', NULL, 'GEN_1930', 'terinosclarissa', 'Terinos clarissa', 'Boisduval, 1836.', NULL, 'SPA_02096', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2089, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Terinos', NULL, 'GEN_1930', 'terinosterpander', 'Terinos terpander intermadia', '(Godfrey, 1916)', '', 'SPA_02097', 'Đặc điểm giống: là giống gồm các loài có kích cỡ từ trung bình tới lớn với chót cánh trước như bị cắt bằng, cánh sau có đuôi. Mặt trên có màu nền đỏ sẫm và còn có màu đen, ánh xanh dương, ánh xanh lục và màu đỏ cam. Con đực có mảng đen lớn được hình thành do các vẩy đặc biệt ở góc dưới, chót cánh trước và tương tự như vậy nhưng nhỏ hơn ở áp mép, góc trên cánh sau.. Mặt trên cánh trước là một màu tím than với mép bờ cánh và chót cánh là màu nâu đậm. chóp cánh uốn cong ra ngoài tạo thành một vòng cung. Cánh sau có màu tím nhạt từ gốc cánh đến khoảng giữa cánh, rìa cánh có màu nâu bạc với đường viên màu tím là loài nhỏ nhất trong giống Terinos ở Việt Nam và phân biệt với loài Terinos clarissa ở đuôi cánh sau có một điểm nhọn ra tạo thành dạng một chiếc đuôi ngắn nhưng ngắn hơn Terinos clarissa. Mặt dưới cánh với các đường viền màu và khoang màu nâu đậm từ gốc cánh chay ra phiá ngoài chóp cánh.. Chóp cánh trước có một đốm màu trắng rất đặc trưng.', NULL, 'Loài này có ở Thái Lan, Cambodia và ở Việt Nam chúng phân bố từ các tỉnh miền Trung vào đến các tỉnh miền Đông Nam bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=5&loai=3&ID=295'),
(2090, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Tirumala', NULL, 'GEN_1963', 'tirumalagautama', 'Tirumala gautama', '(Moore, 1877)', '', 'SPA_02098', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2091, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Tirumala', NULL, 'GEN_1963', 'tirumalalimniace', 'Tirumala limniace', '(Cramer, [1775])', '', 'SPA_02099', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2092, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Tirumala', NULL, 'GEN_1963', 'tirumalaseptentrionis', 'Tirumala septentrionis septentrionis', '(Butler, 1774)', '', 'SPA_02100', 'Một trong những loài có kích thước lớn trong họ Bướm đốm Danaidae. Khá dễ nhận diện nhờ các đốm màu xanh rõ rệt và nhỏ khiến cho nền đen sậm ở mặt trên cánh nổi bật. Tuy nhiên loài này rất dễ nhầm với Bướm hổ xanh Tirumala  limniace. Bướm đực và bướm cái giống nhau. Sải cánh: 90 -150mm. Gặp chung với các loài Ideopsis vulgaris và ideopsis similis, nhưng số lượng thường ít hơn. Loài bướm khá lớn này xuất hiện ở một số nơi từ các dải rừng tốt đến rừng phục hồi thứ sinh và những vùng đất canh tác ở mọi độ cao. Xuất hiện ở một số nơi từ các dải rừng tốt đến rừng phục hồi, rừng thứ sinh và những vùng đất canh tác ở mọi độ cao. Bướm trưởng thành đậu ở những cụm hoa cỏ và cây bụi thuộc chi Thơm ổi Lantana camara và Thanh quan Duranta erecta họ Cỏ roi ngựa Verbenaceae; Cỏ hôi và Đại bi Blumea balsamifera họ Cúc Asteraceae. Bướm cái đẻ trứng trên cây Ngô thi Asclepias curassavica, Đầu dài, Di hùng và một số cây thuộc họ Thiên lý Asclepiadaceae', NULL, ' Từ Ấn Độ đến Nam Trung Quốc, Đài Loan và bán đảo Mã lai, xa hơn đến Sunderland và Philippin. ', NULL, NULL, 'Tùy thuộc vào điều kiện sống và hệ sinh thái từng nơi mà gặp được đại diện của loài này nhiều, ít hay không gặp. Dù hiện chưa là loài quý hiếm nhưng đây cũng là một loài có kích thước lớn với sải cánh dài tối đa có thể đến trên dưới 150mm và có màu sắc vừa sặc sỡ vừa đằm thắm. Có thể nhân nuôi loài này trong trang trại để thu mẫu làm tiêu bản, làm tranh và trao đổi, thương mại.', NULL, NULL, NULL, 'vncreatures.net'),
(2093, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Vagrans', NULL, 'GEN_2022', 'vagransegista', 'Vagrans egista', 'Crame, 1780', 'Bướm đuôi', 'SPA_02101', 'Bướm đực và bướm cái giống nhau. Loài này có thể dễ dàng phân biệt được bởi cánh sau có đuôi. Bướm có đặc điểm bay nhanh và xa. Đây là loài khá phổ biến dọc đường, sông và suối ở thung lũng và đỉnh đồi, chúng bị hấp dẫn bởi một số cây có hoa Loài này thường xuất hiện vào cuối mùa mưa ở khu vực miền Đông nam bộ. Ở ven đường hay các khu vực trống trải trong rừng và thường di chuyển các bước nhảy liên tục trên mặt đất hoặc thảm thực vật rừng khô. Ít khi thấy đậu trên lá cây. Sâu non ăn lá một số loài cây', NULL, 'Gặp mọi nơi ở Việt Nam Nepal và Đông Bắc Ấn Độ về phía Đông đến Nam Trung Quốc và Hải Nam, phía Nam qua Philippin và Đông Dương đến Sunderland, Tân Ghi-nê và đến tận Australia', NULL, NULL, 'Có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
(2094, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Vanessa', NULL, 'GEN_2027', 'vanessacardui', 'Vanessa cardui', '(Linnaeus, 1758)', NULL, 'SPA_02102', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2095, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Vanessa', NULL, 'GEN_2027', 'vanessaindica', 'Vanessa indica', '(Herbst, 1794)', NULL, 'SPA_02103', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2096, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Vindula', NULL, 'GEN_2037', 'vinduladejone', 'Vindula dejone erotella', '(Bulter, [1879])', '', 'SPA_02104', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2097, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Nymphalidae', 'Bướm Giáp', 'FAM_261', 'Vindula', NULL, 'GEN_2037', 'vindulaerota', 'Vindula erota', '(Fabricius, 1793)', NULL, 'SPA_02105', 'Đặc điểm nhận dạng:\n\nGiống Vindula có kích thước lớn. Sải cánh : 90-110mm. Mặt trên cánh con đực có màu vàng cam với hai đường đen lượn sóng ở gần mép ngoài cánh. Trên cánh cũng có các đốm, vệt màu đen ở vùng giữa. Cánh sau có hai đốm mắt và một đuôi ngắn. Mặt dưới nhạt màu hơn. Việt Nam có hai loài thuộc giống này, nhận diện rất dễ, nhưng khó phân biệt đến cấp loài bằng cách quan sát nhanh do sự khác biệt ở những chi tiết nhỏ. Con cái có màu xỉn hơn ánh xanh lục, ít gặp hơn con đực. Bướm cái lớn hơn và có màu đất nâu hơi xám ánh xanh lục với dải trắng và hoa văn lượn sóng ở hai cánh.\n\nSinh học sinh thái:\n\nĐặc điểm chung: Rất phổ biến trong rừng vào mùa mưa. Thường gặp ven đường mòn. Tương tự các loài khác trong cùng nhóm (tộc phụ Vagrantini), khi đậu xuống mặt đất để hút khoáng, ban đầu nó thường bò đi bò lại, đến khi tìm được chỗ thích hợp mới ngưng, trong lúc bò cánh thường khép vào mở ra. Sâu ăn lá họ cây Nhãn lồng Passifloraceae là ký chủ của các loài sâu Bướm nhãn lồng đỏ Acraea violae, Bướm báo hoa vàng Cethosia cyane. Bướm cái ít gặp hơn bướm đực, chủ yếu ở trong rừng. Bướm đực gặp khá phổ biến gần nguồn nước. Vì sâu non còn ăn lá cây chùm bao Passiflora foetida và nên chúng thường cạnh tranh thức ăn với một số loài bướm như Cethosia cyane, Acraea violae …', NULL, 'Phân bố từ Ấn Độ đến Trung Quốc và Nam đến Sunderland. Đây là một trong những loài phổ biến nhất, có khắp nơi ở Việt Nam. Ở mọi độ cao, đặc biệt phổ biến ở độ cao 1.200m và các rừng thứ sinh, trảng cỏ, bụi cây ở độ cao dưới 700m', NULL, NULL, 'Loài bướm to có màu vàng cam sặc sỡ và đẹp, đặc biệt nổi bật trong hộp màu tiêu bản. Chúng tô điểm cho nơi chúng bay và đậu ở ngoài thiên nhiên. Phân bố rộng và thường gặp. Bảo vệ rừng tốt chính là bảo vệ nơi cư trú và cuộc sống của chúng.', NULL, NULL, NULL, NULL),
