(2101, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Atrophaneura', NULL, 'GEN_0184', 'atrophaneuraaidoneus', 'Atrophaneura aidoneus', 'Doubleday, 1845', NULL, 'SPA_02109', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2102, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Atrophaneura', NULL, 'GEN_0184', 'atrophaneuravaruna', 'Atrophaneura varuna astorion', '(Westwood 1842)', 'Bướm phượng cánh dơi thông thường', 'SPA_02110', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2103, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Byasa', NULL, 'GEN_0272', 'byasadasarada', 'Byasa dasarada', '(Moore, 1857)', NULL, 'SPA_02111', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2104, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Byasa', NULL, 'GEN_0272', 'byasapolyeuctes', 'Byasa polyeuctes', '(Doubleday, 1842)', NULL, 'SPA_02112', 'Đặc điểm nhận dạng:\nCon cái và con đực giống nhau. Màu đen, trắng với đuôi nhạn nổi bật. Thân màu đỏ, đầu bụng màu đỏ. Cánh trước hoàn toàn đen. Cánh sau: được khía tai bèo ở phần đuôi nhạn; có mảng trắng hình chữ nhật hoặc hình bình hành nằm ở vị trí gần rìa mép ngoài cánh, đôi khi là ở cả phần giữa cánh ở cả mặt trên và dưới. Thường có 5 đốm đỏ nằm rải rác ở vùng gần đĩa cánh về phía đuôi, trong đó có 1 đốm nằm ở đúng chót đuôi. Sải cánh : 110 - 140mm.\nSinh học, sinh thái:\nLoài này thích những khu rừng và thường phân bố ở độ cao từ 1000 - 5000 fít. Có dáng bay cao, chậm nhưng cũng dễ nhận ra dáng mảnh của cánh trước và sau. Nó bị hấp dẫn bởi các loài hoa, đặc biệt của các cây thơm ổi (Lantana camara), họ Đỗ quyên Ericaceae, cây thuộc chi Bọ chó Buddleia sp. Nó được một loài bướm ngày khác bắt chước, mà loài này có thói quen, mùa sống, và sinh thái tương tự giống nó là loài Epicopa (hoặc Epicopia polydorus). Nhộng của chúng có mùi hôi thối. Gặp ở rừng nguyên sinh và thứ sinh ở mọi độ cao. Không gặp cá thể ở độ cao 1.200 m hay ở các sinh cảnh trảng cây bụi hoặc sinh thái nông nghiệp.', NULL, 'Trong nước: Loài này sống trong các khu rừng nguyên sinh ở Bắc và Trung bộ như VQG Bidoup Núi Bà, VQG Konkakinh.\nThế giới: Nepal, Myanma, phía Bắc Thái Lan, Lào, Pakistan, Bắc Ấn Độ,', NULL, NULL, 'Là loài hiếm thấy, đẹp, có hình thù cánh sau rất đặc biệt, nó còn mỹ miều hơn khi được làm thành tiêu bản để trong tủ kính, do đó rất hấp dẫn những nhà sưu tầm. Cần bảo vệ tốt nơi cư trú của chúng là rừng rậm tự nhiên trên núi cao như VQG Bidoup Núi Bà, Konkakinh, Tam Đảo và cấm thu bắt bừa bãi để quần thể của chúng được bảo tồn và phát triển.', NULL, NULL, NULL, 'vncreatures.net'),
(2105, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Chilasa', NULL, 'GEN_0375', 'chilasaagestor', 'Chilasa agestor', 'Gray, 1831.', NULL, 'SPA_02113', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2106, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Chilasa', NULL, 'GEN_0375', 'chilasaclytia', 'Chilasa clytia clytia', '(Linnaeus 1758)', 'Bướm phượng mạo danh thông thường', 'SPA_02114', 'Bướm có kích thước lớn. Bướm đực và bướm cái hoàn toàn khác nhau. Bướm đực có màu nâu chủ đạo, bướm cái với các sọc màu xanh xám đen. Mặt trên bướm đực: phần cánh trên có ba vệt sáng lớn xuất phát từ gốc hướng ra ngoài cánh. Một vệt lớn, dài và bị phân tách làm đôi ở rìa cánh trong, một vệt tiếp theo ở phần liền kề rìa cánh trong và vệt cuối cùng lớn, bị phân tách thành bốn ở phần trung tâm cánh. Có các đốm ở gần rìa ngoài cánh và rìa ngoài cánh. Phần trung tâm cánh sau được phủ màu trắng hoàn toàn bởi một trong ba vệt đi từ gốc cánh. Các vệt khác được túa ra từ trung tâm của cánh, với các đốm màu đỏ cam từ giữa cho đến cuối mép ngoài cánh. Mặt dưới giống như mặt trên, nhưng có các vết cắt rõ ràng hơn và các đốm rìa ngoài cánh màu vàng.\n\nNgoài ra, các loạt vệt trắng chĩa ra mép ngoài cánh đều có phần chót dạng chữ V và ở cánh sau còn có thêm một hàng các đốm dạng chữ V chạy lượn theo mép cánh. Loài này có hai dạng bắt chước: dạng bắt chước loài Ideopisis simillis (nền đen, đốm và vạch trắng) và dạng bắt chước loài Euploea core (nền nâu, đốm và vạch trắng). Nếu quan sát thật kỹ có thể nhận thấy những đặc điểm rất đặc trưng của họ bướm Phượng như chân dài, chót râu cong, khi vừa đậu cánh thường vẫn đập một lúc. Bướm có một số dạng khác nhau, trong đó có 2 dạng phân loài phổ biến ở khắp Việt Nam. Bướm Chilasa clytia là một kiểu bắt chước loài bướm độc Ideopsis simili. Trong khi đó dạng clytia là bắt chước của Euploea core. Phổ biến, gặp ở những chỗ trống, có cây bụi, hoa dại… Sâu non màu vàng ở lưng và đầu, sâu lớn có các đốm đỏ. Nhộng ngụy trang như một mẩu cành khô, thường ở dưới mặt lá hoặc phía dưới một cành cây nhỏ. Sâu non ăn lá cây Long não Cinnamomum camphora và Màng tang Litsea cubeba (cả hai thuộc họ Long não Lauraceae).', NULL, ' Loài này phân bố từ Ấn Độ đến Trung Quốc, phía Nam qua Đông Dương đến Philippin và bán đảo Malaisia. ', NULL, NULL, 'Đây là một loài bướm Phượng to, đẹp có giá trị trong phân loại học và đặc biệt là trong đa dạng sinh học bởi tính chất mạo danh - giống các loài bướm thuộc họ khác của chúng. Chúng phổ biến nhưng không gây hại đến ngưỡng kinh tế cho cây trồng và cây rừng.', NULL, NULL, NULL, 'vncreatures.net'),
(2107, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Chilasa', NULL, 'GEN_0375', 'chilasaepycides', 'Chilasa epycides', '(Hewitson, 1862).', NULL, 'SPA_02115', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2108, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Chilasa', NULL, 'GEN_0375', 'chilasamahadeva', 'Chilasa mahadeva', '(Moore [1879])', '', 'SPA_02116', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2109, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Chilasa', NULL, 'GEN_0375', 'chilasaparadoxa', 'Chilasa paradoxa telearchus', '(Hewitson 1852)', 'Bướm phượng mạo danh lớn', 'SPA_02117', 'cánh trước màu nâu sẫm có nhiều đốm màu xanh lam, một vệt hình bầu dục ngắn hoặc đốm lớn và một loạt đốm hoàn chỉnh ở phần sau đĩa và phần dưới đầu màu trắng xanh; cả hai chuỗi đốm đều cong vào trong trên cánh về phía trước, chuỗi các đốm bên trong kéo dài ra. Cánh sau có nhiều lông màu nâu, có hoặc không có một loạt đốm trắng ở phần dưới đầu và tăng kích thước về phía trước. Mặt dưới màu nâu sô-cô-la đậm đà. Cánh trước: vệt ngắn tế bào mờ nhạt, không có hàng loạt đốm sau đĩa đệm ở mặt trên, loạt đốm ở phần dưới màu trắng, kích thước các đốm giảm đi nhiều. Cánh sau: có dấu hiệu ở mặt trên. Lông mao màu nâu sẫm xen kẽ thưa thớt với màu trắng. Ăng-ten màu đen; đầu, ngực và bụng màu nâu mượt, đầu và phần trước của ngực, ngực và bụng bên dưới có vài đốm trắng. Nữ giới. Mặt trên, cánh trước: ở gốc nửa nâu xỉn, ở đỉnh nửa nâu có đốm xanh sáng; các dấu hiệu giống như ở con đực, nhưng lớn hơn và trắng hơn, các đốm ở dãy sau đĩa dài hơn. Cánh sau màu nâu, một loạt các vệt màu trắng tương đối rộng trong tế bào và ở tất cả các khoảng trống, những vệt ở phần cuối tạo thành một loạt các đốm trắng sau đĩa; ngoài những điểm này là một loạt các đốm trắng nổi bật ở phía dưới. Lông mao màu nâu, trắng ở giữa các kẽ. Mặt dưới: các vết màu nâu xỉn nhạt giống như ở mặt trên, nhưng lớn hơn, lan tỏa hơn, cộng thêm các vệt màu trắng ở phần trước trong tế bào và ở các khoảng trống phía sau. Ăng-ten màu đen; đầu, ngực và bụng màu nâu đen, có nhiều đốm trắng hơn ở con đực.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2110, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Chilasa', NULL, 'GEN_0375', 'chilasaslateri', 'Chilasa slateri slateri', 'Hewitson, 1857', 'Bướm Mạo Danh Vạch Ngang Xanh ', 'SPA_02118', 'Mặt trên cánh trước có màu đen quạ, nhạt dần ra phía đỉnh và rìa ngoài cánh, đôi khi có hai hoặc ba đốm hoặc các vệt ngắn ở đỉnh vùng trung tâm cánh, theo sau là một loạt các đốm màu xanh sáng hình chuỳ, phần cụt hướng ra ngoài, đôi khi dưới ánh sáng có sắc tím; cánh sau: màu chocolate tối, loạt các đốm trắng ngắn sát mép ngoài cánh ở mặt dưới nhìn rất mờ, còn đốm lớn ở góc dưới màu đất son được viền bằng màu đen. Mặt dưới có màu nâu socola đỏ đun. Cánh trước: có những vệt ở vùng trung tâm vùng đĩa cánh, màu xanh của mặt trên được thay thế bằng những vệt trắng phức tạp; cánh sau: có những đốm nhỏ ở gốc cánh. Bụng, lưng, râu, đầu màu đen, phía dưới bụng có những mảng trắng, và có hai hàng các đốm nhỏ. Sải cánh : 80-100mm. Là loài sống ở những vùng cao, tuy nhiên, có thể tìm thấy ở những sinh cảnh thấp hơn. Xuất hiện nhiều vào gần và giữa giai đoạn gió mùa và sau đó hiếm dần. Nó được ghi nhận là xuất hiện ở Sikkim vào tháng 4. Thức ăn của sâu non là các loài thực vật thuộc giống Cimamomum sp.', NULL, ' Nam và Đông Nam Á: Sikkim, Mianma, Thái Lan, Lào và Việt Nam', NULL, NULL, 'Loài này đẹp tuy không phải là loài phân bố hẹp nhưng hiếm gặp so với loài C.clytia và loài dễ nhầm với các loài bướm thuộc giống Euploea (họ Danaideae). Cần bảo vệ tốt nơi cư trú cho chúng là các vùng rừng cao, rừng tự nhiên, tạo điều kiện tốt cho loài này được phục hồi và phát triển.', NULL, NULL, NULL, 'vncreatures.net'),
(2111, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Graphium', NULL, 'GEN_0792', 'graphiumagamemnon', 'Graphium agamemnon agamemnon', '(Linnaeus 1758)', '', 'SPA_02119', 'Là loài bướm màu nền đen với các dải và đốm xanh lục. Mặt trên: cánh trước con đực có một dãy các chấm chạy dọc theo mép trên lưng của cánh; một dãy chấm khác ở vùng trung tâm, dãy thứ 3 được tạo thành bởi 5 chấm chấm kép; một dãy chấm khác ở vùng đĩa cánh và một dãy chấm nữa chạy dọc theo mép cánh; ở vùng gốc cánh có những chấm đơn nằm ngang. Trên cánh sau có một chấm dài chạy từ gốc cánh xuống đến đoạn giữa mép bụng cánh, ngắt quãng tại đó rồi lại tiếp tục kéo dài đến gần cuối mép bụng cánh; còn có một dãy các chấm ở đĩa cánh và dãy các chấm chạy theo mép cánh. Bụng có màu đen.\n\nMặt dưới: màu nâu chiếm ưu thế hơn màu đen làm màu nền. Đặc biệt một vài chỗ ở phía đuôi cánh trước và những chấm ở vùng gốc cánh sau nhập lại với nhau có màu hồng. Các chấm ở cánh trước tương tự như ở mặt trên nhưng mờ nhạt hơn - cánh sau có một chấm ở gốc cánh màu hồng, ở vùng 6 và 7 và cả ở nơi bắt đầu của đuôi cánh có các đốm màu đen viền bằng màu đỏ. Ngực và bụng có màu đỏ. Rất dễ nhận diện vì loài này có màu sắc và hình thái bên ngoài khác hẳn với các loài khác thuộc giống Graphium. Bướm cái và bướm đực giống nhau nhưng bướm cái hơi lớn hơn và có các dải đuôi kéo dài hơn. Sải cánh: 90-120mm. Rất phổ biến, cả trong rừng lần thành thị. Thường gặp với số lượng lớn ven suối, vùng nước trong rừng. Sâu của giống Graphium ăn lá các loại cây thuộc họ Na (Annonaceae). Sâu non màu nâu, sâu lớn màu xanh. Nhộng ngụy trang dạng lá cây. Bướm thường gặp ở vùng làng quê, trong vườn, công viên và những khu vực trống trong thành phố gần thảm thực vật thứ sinh. Bướm cái đẻ trứng trên các cây thuộc chi Bướm cái đẻ trứng trên các cây thuộc chi Hoa giẻ, và chi Nhọc Polyalthia sp. thuộc họ Na Annonaceae và một số cây thuộc chi Giổi họ Ngọc lan Magnoliaceae.', NULL, 'phổ biến nhất trên toàn lãnh thổ Việt Nam.  Ấn Độ đến Trung Quốc qua quần đảo San-đa đến Australia và quần đảo Salomon.', NULL, NULL, 'Là loài bướm có màu sắc đẹp và không lẫn với các loài bướm khác. Có thể nhân nuôi loài này để lấy cánh bướm ghép lên các bức tranh như tranh đông hồ… tuy loài phân bố rộng nhưng có số lượng cá thể thấp nên vẫn cần bảo vệ và hạn chế thu bắt chúng.', NULL, NULL, NULL, 'vncreatures.net'),
(2112, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Graphium', NULL, 'GEN_0792', 'graphiumagetes', 'Graphium agetes agetes', 'Westwood, 1841', NULL, 'SPA_02120', 'Con đực và con cái có mặt trên màu trắng. Cánh trước: tế bào được cắt ngang bởi ba dải màu đen xiên, tương đối rộng, dải trong cùng được tạo ra qua các khoảng gian 1 và la đến mép lưng, cạnh gân 1, đôi khi hơi xa hơn một chút vào khoảng gian 1a, dải thứ ba đến gân giữa; theo sau là một đốm đen sườn hình tam giác phía trên đỉnh trên của tế bào; một dải xiên sau đĩa tương tự như các dải khác kéo dài từ bờ biển đến ngay phía trên Tortus, nơi nó nối với một viền cuối rộng màu đen nằm giữa đỉnh của cánh và Tortus; rìa sườn được viền bằng một sợi chỉ đen mở rộng ra ngoài dải sau đĩa đệm một chút. Màu nền trắng ở nửa trước của tế bào, từ đỉnh của phần sau đến dải màu đen sau đĩa đệm, và ở khu vực giữa dải sau đĩa đệm và dải cuối, là hyaline (giống như thủy tinh) với tông màu vàng lục. Cánh sau: có một đốm ở góc rách, thùy hậu môn, đuôi và rìa cuối màu đen; phía trên vết rách là một dải màu đỏ ngắn, tương đối rộng, được viền phía trước bởi một đường đen mảnh nối vết rách với màu đen trên thùy hậu môn; chồng lên màu đen của rìa cuối có một số vảy màu trắng mờ; một đốm trắng ở đầu dưới hình tam giác nằm ngang ở khoảng cách 3 và đôi khi có một vạch trắng ngắn ở đầu cuối ở khoảng cách 4; mép trước của đuôi ở gốc cũng có màu trắng. Nhìn từ mặt dưới trong suốt là hai dải màu đen ngang hội tụ, dải bên ngoài được cắt ngang bởi các đường ngang ngắn màu đỏ ở các giao điểm 2, 6, 7 và 8. Mặt dưới tương tự; cánh sau có thêm hai dải màu đen nêu trên, chúng kết lại phía trên vùng rách. Râu, đầu, ngực và bụng màu đen, đầu có vạch đỏ, ngực hai bên có lông tơ màu xám; bụng có sọc trắng bên; bên dưới, màu trắng', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2113, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Graphium', NULL, 'GEN_0792', 'graphiumantiphates', 'Graphium antiphates pompilius', ' (Fabricius [1878])', '', 'SPA_02121', 'Bướm có kích thước trung bình, sải cánh dài 85 - 90 mm. Cánh con đực và con cái có kích thước giống nhau, màu trắng vàng có nhiều vạch đen, mặt trên của cánh trước có 7 vạch đen, vạch thứ hai kéo dài tới giữa cánh còn lại kéo dài khoảng 1/5 cánh. Cánh sau có đuôi dài dạng kiếm. Mép cánh và kiếm có màu đen. Mặt trên của cánh sau màu trắng vàng với nhiều vệt và chấm đen Thường gặp ở vùng rừng núi nước ta. Thường thấy ở bìa rừng, ven suối và nơi ẩm ướt, khi trời nắng đẹp bướm thường bay rập rờn trên các đỉnh cây bụi có hoa. Vào buổi trưa bướm thường tìm nơi đất ẩm ướt ven suối, vũng nước để đậu, lúc này dễ dàng bắt được chúng', NULL, 'Các tỉnh có núi rừng từ Bắc đến Nam Ấn Độ, Nam Trung Quốc. Các nước này cũng có nhiều vùng hiếm thấy', NULL, NULL, 'Bướm đẹp, làm cảnh, được nhiều nhà sưu tầm bướm ưa thích, Đời sống gắn với rừng ẩm nên chúng còn là chỉ thị của môi trường. Một khi bướm không xuất hiện, nghĩa là rừng nơi đó bị phát quang', NULL, NULL, NULL, 'VN Creature'),
(2114, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Graphium', NULL, 'GEN_0792', 'graphiumaristeus', 'Graphium aristeus hermocrates', '(C.&R. Feider [1865] )', 'Bướm phượng đuôi kiếm xích ', 'SPA_02122', 'Bướm đực và cái giống nhau. Đây là loài có số lượng nhiều vào mùa xuân (cuối mùa khô và đầu mùa mưa). Có thể gặp hàng trăm con bướm gần những vũng nước bẩn trên đường. Sâu non ăn lá cây Nhọc Polyalthia sp. thuộc họ Na Annonaceae và cây Phá cố chỉ Psoralea corylifolia họ Đậu Fabaceae. ', NULL, 'là loài phổ biến ở miền Nam Việt Nam và có phân bố cục bộ ở một số tỉnh miền Trung.  Loài này phân bố rộng từ Ấn Độ qua Đông Dương và quần đảo Sanđa đến Tân Ghinê và Nam Australia', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(2115, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Graphium', NULL, 'GEN_0792', 'graphiumarycles', 'Graphium arycles arycleoides', '(Fruhstorfer, 1901)', '', 'SPA_02123', 'Loài này dễ nhầm với Graphium eurypylus và Graphium doson, tuy nhiên Graphium arycles vẫn có thể phân biệt được bởi những chi tiết khác nhau về cấu trúc và cách sắp xếp của các đốm xanh và đặc biệt là mặt dưới cánh sau. Con đực và con cái giống nhau. Ở mặt trên, cánh trước có 3 vạch mỏng, ngắn, nhỏ ở gốc của phần trung tâm màu xanh nhạt, phía bên trên đỉnh của vùng trung tâm có thêm 2 đốm cùng màu. Phần giữa của cánh là một dải các vạch màu xanh liên tục kéo dài từ 2 đến 5 với độ lớn nhỏ dần, theo đó dải số 5 là nhỏ nhất, trên đó là hai chấm nhỏ của gốc dải số 7 và kết thúc bằng một chấm của dải số 8, tất cả đều màu xanh nhạt. Viền cánh được trang trí bằng một dải vòng cung các chấm màu xanh nhạt. Ở cánh sau, vùng giữa là một dải như là nối tiếp phần giữa của cánh trước, có phần trên màu trắng, và xanh dần ở phần dưới. Các chấm xanh ở cánh trên như được kéo dài, nối tiếp bằng hệ thống các chấm ở mép cánh sau. Ở mặt sau, có một dải trắng kéo dài từ gốc cánh đến mép trong cánh, với màu nền là màu đen tuyền, có một chấm đỏ ở vị trí 8,1,2,3, một chấm hình chữ nhật màu đen ở đỉnh vùng trung tâm, một dải màu trắng ở phần giữa sát gốc. Và cuối cùng là mép ngoài được viền bởi các đốm xanh nhạt thành hình vòng cung. Sải cánh: 75 - 90mm. Là loài khá phổ biến, thường tập trung số đông cùng với nhiều loài khác ở các vũng nước đọng trong rừng tự nhiên, nơi có các lối mòn đi trong rừng và dọc sống, suối, nhất là nơi có chất thải động vật để hút khoáng chất. Khi trứng bắt đầu nở, ấu trùng có màu đen, khi lớn dần lên có màu nâu và chuyển thành màu xanh lá cây và màu sắc này vẫn được giữ nguyên, tuy nhiên hơi xỉn hơn khi chúng chuyển sang dạng nhộng. Sâu non ăn các loài thực vật thuộc họ Cam Ruataceae. Con trưởng thành có màu nền đen, với các màu xanh và trắng được bố trí không đồng đều và phía sau thì được điểm thêm một số màu đỏ nữa.      ', NULL, ' Đông bắc và Nam Á (Sikkim, Mianma, Thái Lan, Lào, Cambodia, Malaisia, Việt Nam) loài này khá phổ biến.', NULL, NULL, 'Cũng như loài Graphium sp. khác, loài này tuy phổ biến nhưng có màu sắc đẹp, mượt mà và rất thu hút sự quan tâm của các nhà sưu tầm, yêu thiên nhiên nên đã thu bắt chúng quá mức, dễ dẫn tới giảm thiểu số lượng cá thể của chúng một cách nhanh chóng. Có thể nhân nuôi chúng ở các trang trại hoặc công viên, nơi vui chơi giải trí, chúng không phải là đối tượng dịch hại. ', NULL, NULL, NULL, 'vncreatures.net'),
(2116, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Graphium', NULL, 'GEN_0792', 'graphiumchironides', 'Graphium chironides chironides', '(Honrath [1884])', '', 'SPA_02124', 'Có các mảng màu trắng bạc sau: một dải cơ bản rộng vừa phải kéo dài từ sườn ngang qua cánh và dọc theo lưng đến góc rách, các vệt dài, rộng trong tế bào và ở các khoảng trống 2 và 3, một đốm nhỏ ở gốc của khoảng trống 4 , một vết hình nón hướng vào trong lớn hơn ở đáy 6, một vết vuông góc rất lớn ở 7, và một vết kéo dài như thế ở 6 trong không gian giao nhau nhưng hướng ra ngoài không phải là hình nón hướng vào trong, bên trong hai điểm sau là hai vết mặt trăng rộng trong các giao điểm 7 và 8; tất cả các dấu hiệu cơ bản phía trước đều nhuốm màu vàng mượt; ở nửa ngoài của cánh có một loạt đốm màu vàng cam ở phần sau của cánh và một loạt các đốm màu trắng bạc hoàn chỉnh ở phần dưới cánh, hai đốm phía trên có thêm các vệt ngắn hẹp, hẹp có màu tương tự bên dưới chúng trong các khoảng trống. Đầu râu và ngực màu đen, ngực có màu xám sẫm, bụng màu nâu đen; bên dưới và bụng bên có vạch và sọc trắng.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2117, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Graphium', NULL, 'GEN_0792', 'graphiumdoson', 'Graphium doson axion', '(C.&R. Feider1864)', '', 'SPA_02125', 'Con đực và con cái giống nhau. Ở mặt trên, cánh trước có 3 vạch mỏng, ngắn, nhỏ ở gốc của phần trung tâm màu xanh nhạt, phía bên trên đỉnh của vùng trung tâm có thêm 2 đốm cùng màu. Phần giữa của cánh là một dải các vạch màu xanh liên tục kéo dài từ 2 đến 5 với độ lớn nhỏ dần, theo đó dải số 5 là nhỏ nhất, trên đó là hai chấm nhỏ của gốc dải số 7 và kết thúc bằng một chấm của dải số 8, tất cả đều màu xanh nhạt. Viền cánh được trang trí bằng một dải vòng cung các chấm màu xanh nhạt. Ở cánh sau, vùng giữa là một dải như là nối tiếp phần giữa của cánh trước, có phần trên màu trắng, và xanh dần ở phần dưới. Các chấm xanh ở cánh trên như được kéo dài, nối tiếp bằng hệ thống các chấm ở mép cánh sau. Ở mặt sau, có một dải trắng kéo dài từ gốc cánh đến mép trong cánh, với màu nền là màu đen tuyền, có một chấm đỏ ở vị trí 8,1,2,3, một chấm hình chữ nhật màu đen ở đỉnh vùng trung tâm, một dải màu trắng ở phần giữa sát gốc. Và cuối cùng là mép ngoài được viền bởi các đốm xanh nhạt thành hình vòng cung. Sải cánh: 75-90mm.', NULL, 'Đông bắc và Nam Á (Sikkim, Mianma, Thái Lan, Lào, Cambodia, Malaisia) và ở Việt Nam chúng là loài không phổ biến. Phân bố ở độ cao dưới 700m ở các khu rừng thứ sinh và trảng cây bụi, thảm cỏ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=3&ID=380'),
(2118, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Graphium', NULL, 'GEN_0792', 'graphiumeurypylus', 'Graphium eurypylus cheronus', '(Fruhstorfer [1903] )', '', 'SPA_02126', 'Loài này dễ nhầm với Graphium doson và Graphium arycles, tuy nhiên Graphium eurypylus vẫn có thể phân biệt được bởi những chi tiết khác nhau về cấu trúc và cách sắp xếp của các đốm xanh và đặc biệt là mặt dưới cánh sau. Con đực và con cái giống nhau. Ở mặt trên, cánh trước có 3 vạch mỏng, ngắn, nhỏ ở gốc của phần trung tâm màu xanh nhạt, phía bên trên đỉnh của vùng trung tâm có thêm 2 đốm cùng màu. Phần giữa của cánh là một dải các vạch màu xanh liên tục kéo dài từ 2 đến 5 với độ lớn nhỏ dần, theo đó dải số 5 là nhỏ nhất, trên đó là hai chấm nhỏ của gốc dải số 7 và kết thúc bằng một chấm của dải số 8, tất cả đều màu xanh nhạt. Viền cánh được trang trí bằng một dải vòng cung các chấm màu xanh nhạt. Ở cánh sau, vùng giữa là một dải như là nối tiếp phần giữa của cánh trước, có phần trên màu trắng, và xanh dần ở phần dưới. Các chấm xanh ở cánh trên như được kéo dài, nối tiếp bằng hệ thống các chấm ở mép cánh sau. Ở mặt sau, có một dải trắng kéo dài từ gốc cánh đến mép trong cánh, với màu nền là màu đen tuyền, có một chấm đỏ ở vị trí 8,1,2,3, một chấm hình chữ nhật màu đen ở đỉnh vùng trung tâm, một dải màu trắng ở phần giữa sát gốc. Và cuối cùng là mép ngoài được viền bởi các đốm xanh nhạt thành hình vòng cung. Sải cánh: 75-90mm. Là loài khá phổ biến, thường tập trung số đông cùng với nhiều loài khácvở các vũng nước đọng trong rừng tự nhiên, nơi có các lối mòn đi trong rừng và dọc sống, suối, nhất là nơi có chất thải động vật để hút khoáng chất. Khi trứng bắt đầu nở, ấu trùng có màu đen, khi lớn dần lên có màu nâu và chuyển thành màu xanh lá cây và màu sắc này vẫn được giữ nguyên, tuy nhiên hơi xỉn hơn khi chúng chuyển sang dạng nhộng. Sâu non ăn các loài thực vật thuộc họ Cam Ruataceae. Con trưởng thành có màu nền đen, với các màu xanh và trắng được bố trí không đồng đều và phía sau thì được điểm thêm một số màu đỏ nữa.              ', NULL, 'ở Việt Nam chúng là loài không phổ biến. Đông bắc và Nam Á (Sikkim, Mianma, Thái Lan, Lào, Cambodia, Malaisia)', NULL, NULL, 'Cũng như loài Graphium sp. khác, loài này tuy phổ biến nhưng có màu sắc đẹp, mượt mà và rất thu hút sự quan tâm của các nhà sưu tầm, yêu thiên nhiên nên đã thu bắt chúng quá mức, dễ dẫn tới giảm thiểu số lượng cá thể của chúng một cách nhanh chóng. Có thể nhân nuôi chúng ở các trang trại hoặc công viên, nơi vui chơi giải trí, chúng không phải là đối tượng dịch hại. ', NULL, NULL, NULL, 'vncreatures.net'),
(2119, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Graphium', NULL, 'GEN_0792', 'graphiumevemon', 'Graphium evemon albociliatis', '(Fruhstorfer 1901)', '', 'SPA_02127', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2120, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Graphium', NULL, 'GEN_0792', 'graphiummacareus', 'Graphium macareus indochinensis', '(Fruhstorfer 1901)', '', 'SPA_02128', 'Đặc điểm nhận dạng:\nDễ nhầm với loài nào đó của họ bướm đốm Danaidae nếu nhìn thoáng qua. Mặt trên con đực: Cánh trước: sọc ở phần gốc và phần giữa có màu trắng nằm ngang song song, rộng, nếu không thì vẫn rộng hơn sọc gân; ở trung tâm cánh trước có ba đường ngang, có thể hơn hoặc kém, là những đường song song, có điểm gốc cũng như hai điểm chót cánh,  bao quanh đỉnh của trung tâm cánh là bốn chấm nhỏ. Ở cánh sau, sọc của trung tâm cánh dài và trắng, gần như điền kín vùng trung tâm, và vùng rìa trên cánh rất nhạt. Mặt dưới cánh: Giống như mặt trên, nhưng được điểm bằng các mảng hình mũi tên màu trắng giữa vùng sọc giữa và vùng sọc giữa gần mép cánh. Sải cánh: 80-100mm.\nSinh học sinh thái:\nGiống như các loài khác trong giống Graphium trong rừng tự nhiên. Chúng chỉ sống ở nơi rừng tự nhiên còn tốt. Loài này bay chậm và thường hút nhụy hoa trên các loài thực vật có hoa như Cỏ hôi Ageratum conyzoides, Ngũ sắc Lantana camara ... Thỉnh thoảng cũng gặp chúng tụ tập cùng các loài bướm khác hút chất khoáng trong các vũng nước đọng trên các lối đi trong rừng.', NULL, 'Sikkim, Bắc Thái Lan, Lào, Malaixia và Việt Nam. Là loài phân bố hẹp và số lượng cá thể ít. Phân bố ở độ cao dưới 700m, ở các khu rừng thứ sinh và các trảng cỏ. Đôi khi gặp  ở độ cao dưới 700m, ở các khu rừng thứ sinh và các trảng cỏ.', NULL, NULL, 'Giống như các loài thuộc giống Graphium, loài này gặp không thường xuyên và có thể nói là hiếm gặp do đó chúng rất có giá trị về phân loại học và đa dạng sinh học. Cần bảo vệ nơi cư trú cho chúng là rừng tự nhiên và hạn chế thu bắt', NULL, NULL, NULL, 'vncreatures.net'),
(2121, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Graphium', NULL, 'GEN_0792', 'graphiummegarus', 'Graphium megarus megapenthes', '(Fruhstorfer 1902)', '', 'SPA_02129', 'Loài bướm có kích thước nhỏ và mặt cánh trên khá giống với Bướm ngựa vằn lớn Graphium xenocles. Sự khác biệt lớn nhất giữa 2 loài này bởi phía ngoài ở ô cánh sau là các đốm trắng thay vì vạch trắng, vùng dưới cánh sau không có đốm vàng. Con đực và con cái giống nhau, con cái có vạch trắng phớt xanh loang rộng hơn một chút. Mặt trên ở vùng giữa cánh trước có 4 sọc dài. Gặp vào thời gian và địa điểm giống như các loài khác trong giống Graphium trong rừng tự nhiên. Loài này sống ở mọi độ cao, chủ yếu ở các khu rừng thứ sinh và trảng cỏ. Bay chậm và thường hút nhụy hoa trên các loài thực vật có hoa như Cỏ hôi Ageratum conyzoides, Ngũ sắc Lantana camara ... Thỉnh thoảng cũng gặp chúng tụ tập cùng các loài bướm khác hút chất khoáng trong các vũng nước đọng trên các lối đi trong rừng.', NULL, ' Phân bố ở Mianma, Thái Lan,Lào, Việt Nam. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(2122, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Graphium', NULL, 'GEN_0792', 'graphiumnomius', 'Graphium nomius', '(Esper, 1799)', NULL, 'SPA_02130', 'chiều rộng lớn hơn của các mảng màu đen ở mặt trên, đặc biệt là các dải cơ bản và dưới cơ bản chạy ngang qua cánh trước, cả hai đều kéo dài đến mặt lưng. Ở cánh sau, các vạch đen của mặt dưới trên vùng đáy và đĩa đệm không chỉ được nhìn thấy bằng độ trong suốt từ bên dưới mà trên thực tế được thể hiện, mặc dù chỉ một phần, bằng tỷ lệ màu đen; chiều rộng của phần tận cùng màu xám đen cũng lớn hơn và có xu hướng chuyển sang màu đen sẫm ở phía trước, do đó các dãy lunus đen ở phía tận cùng bị che khuất ở phía trước và rất khó nhận ra. Mặt dưới: các dấu hiệu tương tự như ở dạng thông thường, nhưng rộng hơn; cánh trước có dải ngang đĩa kéo dài từ sườn đến gân 1; cánh sau: các dải màu đen chạy ngang qua tế bào rộng hơn và gần nhau hơn', NULL, 'được tìm thấy ở Nam và Đông Nam Á ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Graphium_nomius'),
(2123, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Graphium', NULL, 'GEN_0792', 'graphiumphidias', 'Graphium phidias', '(Oberthür, 1906)', NULL, 'SPA_02131', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2124, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Graphium', NULL, 'GEN_0792', 'graphiumsarpedon', 'Graphium sarpedon luctatius', '(Linnaeus 1758)', '', 'SPA_02132', 'Mặt trên màu đen đục. Cánh trước và cánh sau bắt chéo từ phía trên vùng rách ở cánh sau đến gần đỉnh của cánh trước bằng một dải ở giữa rộng màu xanh nhạt bán trong suốt, rộng nhất ở giữa, ít nhiều có màu xanh lục và có đốm ở phía trước; phần dải đi qua các khoảng giao thoa 6, 7 và 8 trên màu trắng cánh sau; phía ngoài dải ở cánh sau có một đường ở đầu cuối gồm các lunu mảnh màu xanh lam. Mặt dưới tương tự, màu đất nâu sẫm. Cánh sau: một dải dưới nền tương đối rộng từ tĩnh mạch sườn đến tĩnh mạch dưới sườn, và vùng sau đĩa đệm giữa dải màu xanh trong và các lunu ở phía dưới có màu đen mượt chạy ngang qua các tĩnh mạch nhạt và theo chiều ngang, ngoại trừ ở các khoảng giao nhau 6 và 7, bởi những đường hẹp màu đỏ thẫm; cuối cùng là một đốm đỏ thẫm gần góc rách với một đốm trắng vàng ở rìa bên dưới. Ăng-ten, đầu, ngực và bụng màu nâu, đầu và ngực có màu xám xanh; phía dưới: lòng bàn tay, ngực và bụng có màu trắng đục, bụng có hai đường bên màu trắng.\n\nCon đực có nếp gấp ở bụng màu xám, có một chùm lông dài màu trắng hơi cứng', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2125, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Graphium', NULL, 'GEN_0792', 'graphiumxenocles', 'Graphium xenocles kephisos', '(Fruhstorfer 1902)', 'Bướm ngựa vằn lớn ', 'SPA_02133', 'Nhìn thoáng qua giống với loài Graphium megarus nhưng có kích thước lớn hơn. Con đực và con cái giống nhau, con cái  vạch trắng loang rộng hơn một chút. ở mặt trên có mảng trung tâm cánh trước có 4 sọc, sọc thứ ba hoặc cuối cùng nhìn giống như một dấu hỏi xiên; có hai chấm ở góc trên. Các vạch trên vùng đĩa cánh chĩa thẳng ra mép ngoài cánh và nằm ngang, vạch thứ 2 trong số đó tách làm đôi nhưng vẫn dính liền với nhau, ở con cái có thể hơi tách ra. Ở cánh sau, những sọc trắng túa ra từ gốc và một trong những sọc đó bao phủ vùng trung tâm; bốn sọc nhỏ khác ở vùng giữa và các đốm ở vùng gần mép cánh có màu trắng. Một mảng màu vàng ở vùng góc dưới cánh nhìn giống như màu vàng ở vùng giữa gần mép cánh ở khoảng 2. Mép trong cánh sau với các vạch trắng xanh lớn, có một đốm cam ở cuối cùng. Sải cánh: 85-120 mm. Gặp vào thời gian và địa điểm giống như các loài khác trong giống Graphium sp. Phân bố ở mọi độ cao, chủ yếu ở các khu rừng thứ sinh và trảng cỏ. loài này bay chậm và thường hút nhụy hoa trên các loài thực vật có hoa như Cỏ hôi, Thơm ổi ... Thỉnh thoảng cũng gặp chúng tụ tập cùng các loài bướm khác hút chất khoáng trong các vũng nước đọng trên các lối đi trong rừng.', NULL, ' Phân bố ở Mianma, Thái Lan,Lào, Việt Nam. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(2126, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Lamproptera', NULL, 'GEN_1024', 'lampropteracurius', 'Lamproptera curius curius', '(Fabricius 1787)', 'Bướm phượng đuôi nheo ', 'SPA_02134', 'Bướm có sải cánh dài 40 - 50 mm, con đực và con cái kích thước như nhau. Cánh trước hình tam giác nhọn, gốc cánh màu đen, cánh sau gốc cánh màu đen, hình hẹp kéo dài thành một cái đuôi dài (25 - 40 mm). Phổ biến vào mùa mưa, thường tập trung thành từng đàn lớn vào thời kỳ nở hàng loạt trong rừng tự nhiên và nhất là nơi có rừng rậm. Khi trời nắng bướm thường bay dọc theo các đường mòn và đậu ở nơi đất ẩm ven vũng nước hay bờ suối. Bướm hút mật hoa cây dại hay hút dịch từ các súc vật để sống. Khi bướm hút mật hoa, hút dịch là dễ bị bắt nhất mặc dù là loài bướm bay rất nhanh như chim én bay. Sâu non được ghi nhận ăn lá giống cây Liên đằng Iigera sp., họ Liên đằng Hernandiaceae. Sâu non của loài Lamproptera curius có thể ăn lá cây Khâu tai.', NULL, 'Hà Giang, Thái Nguyên, Hà Tây, Hòa Bình, Ninh Bình, Thanh Hóa, Nghệ An, Hà Tĩnh, Quảng Trị, Đà Nẵng, Gia Lai, Kontum, Đắc Lắc, Đồng Nai...vv. Từ Asam và Trung Quốc đến Suntheland, Philippin', NULL, NULL, 'Bướm có hình dạng lạ đẹp, thường được làm ví dụ trong các sách về côn trùng học về tính đa dạng sinh học của côn trùng, là đối tượng săn lùng của các nhà s­ưu tầm bướm. Loài này đã từng được đưa vào sách đỏ Việt Nam năm 1992, nay thấy đã gặp nhiều hơn nên đã thoát hiểm nhưng vẫn là loài bướm có dáng dấp đặc biệt nên vẫn thu hút sự chú ý của người sưu tầm và có giá trị trong phân loại học, đa dạng sinh học. Do đó, cần bảo vệ nơi cư trú của chúng là rừng tự nhiên và hạn chế thu bắt. ', NULL, NULL, NULL, 'vncreatures.net'),
(2127, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Lamproptera', NULL, 'GEN_1024', 'lampropterameges', 'Lamproptera meges annamiticus', '(Fruhstorfer 1909)', '', 'SPA_02135', 'Đặc điểm nhận dạng:\nCả bướm đực và bướm cái rất giống với loài Bướm phượng đuôi nheo Lamproptera curius, nhưng chúng có một số đặc điểm khác như sau: Vạch ngang ở cánh trước kéo dài đến cuối cánh, vạch này màu xanh lục nhạt, không có màu trắng và không có viền cánh trước màu sáng như ở loài Lamproptera curius. Góc cuối cánh trước có viền đen hẹp hơn hoặc thậm chí khắp chiều rộng cánh. Con đực không có điểm giới tính. Sải cánh từ 43-48cm, gốc cánh sau màu đen với một dải trắng kéo dài thành đuôi. Chót đuôi có màu trắng.\nSinh học, sinh thái:\n\nLoài này thường bay chậm và tập trung thành nhóm nhỏ hút nước bên bờ suối hay các vũng nước đọng trong rừng cùng nhiều loài bướm khác. Đôi khi chúng tập trung đậu trên các lán lá cây bụi thấp ven suối. Thường xuất hiện vào mùa mưa ở phía Nam và ở độ cao dưới 1.200m. Chủ yếu là ở rừng thứ sinh và trảng cỏ, và khu rừng nguyên sinh ở phía Bắc. Thức ăn của  sâu non là loài Illigera sp thuộc họ Lưỡi chó Hernandiaceae. Tên bướm được dịch theo nghĩa tiếng Anh.', NULL, 'Loài bướm này tìm thấy ở Ấn Độ. Burma, Thái Lan, Lào, Nam Trung Quốc, Malaysia và ở Việt Nam chúng có hầu khắp các tỉnh trên toàn quốc.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2128, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Losaria', NULL, 'GEN_1110', 'losariacoon', 'Losaria coon', '(Fabricius, 1793)', NULL, 'SPA_02136', 'Con bướm có sải cánh từ 100 đến 120 mm (3,9 đến 4,7 in). Cả hai giới nhìn chung đều giống nhau, tuy nhiên con cái có cánh rộng hơn và đuôi cánh sau ngắn hơn. Con bướm có đôi cánh dài và hẹp và một cái đuôi hình thìa đặc trưng, ​​​​đó là tên của nó. Cánh trước có màu đen với những vết nhạt giữa các đường gân. Hai phần ba tế bào của cánh sau có màu trắng với một hàng đốm trắng xung quanh. Nó có các lunus màu đỏ thẫm hoặc trắng sẫm dọc theo mép và đĩa.', NULL, 'được tìm thấy từ Quần đảo Nicobar và Assam ở Ấn Độ , phía đông đến Hải Nam ở Trung Quốc , và phía nam qua Đông Dương , đến Java và các đảo khác của Indonesia và Bangladesh.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Losaria_coon'),
(2129, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Meandrusa', NULL, 'GEN_1170', 'meandrusapayeni', 'Meandrusa payeni langsonensis', '(Fruhstorfer, 1901)', NULL, 'SPA_02137', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2130, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Meandrusa', NULL, 'GEN_1170', 'meandrusasciron', 'Meandrusa sciron', '(Leech, 1890)', NULL, 'SPA_02138', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2131, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Pachliopta', NULL, 'GEN_1419', 'pachlioptaaristolochiae', 'Pachliopta aristolochiae asteris', '(Rothschild 1908)', 'Bướm phượng thân hồng', 'SPA_02139', 'Đặc điểm nhận dạng:\n\nBướm đen với đầu đỏ, thân đỏ sẫm và đuôi  hình thìa. Con đực và con cái tương đối giống nhau. Tuy nhiên, con cái có cánh rộng hơn và màu đỏ ở đầu, lưng, bụng sẫm hơn,những phần ở con đực là màu đen thì ở nó là mầu nâu xanh. Con đực: phần gốc cánh là màu đen, phần giữa cánh là các đường gân trắng sáng. Có đường viền ngoài và trong màu đen. Ở phần giữa cánh sau là các vệt trắng, phần gần mép ngoài có các đốm đỏ sẫm. Mặt dưới tương tự như mặt trên với màu đen và đỏ nổi bật hơn. Ở sát mép cánh sau có một vệt đỏ với màu giống như các đốm ở gần mép ngoài cánh. Và các đốm đỏ gần mép ngoài cánh cũng rất nổi bật. Dễ nhận diện bởi thân, đầu có mầu hồng sậm, cánh trước hẹp. Một loài khác gần giống và cách bay cũng tương tự là Parides coon, phân biệt nhờ thân và các đốm ở cánh sau rất nhạt màu, gần như trắng, đuôi thắt lại thành cuống rất mảnh,cánh rất hẹp. Bướm đực và bướm cái giống nhau nhưng bướm cái lớn hơn. Sải cánh : 80-100 mm.\n\nSinh học sinh thái:\n\nLoài thích nghi với nhiều dạng môi trường, được tìm thấy ở những độ cao rất khác nhau từ 3000 feets đến trên 8000 feets, thậm chí ở cả những khu đô thị đông người. Đây là một loài rất phổ biến và dễ quan sát. Loài phổ biến ở khắp nơi, dễ quan sát và được những nhà tự nhiên nghiệp dư rất yêu thích để khám phá. Với những màu sắc đỏ nổi bật, nó cũng cảnh báo với những con ăn thịt chúng là chúng rất nguy hiểm và chúng có thể tiết ra chất độc để bảo vệ mình rất tốt. Chất độc này từ các cây thức ăn của chúng được tích tụ và ở cơ thể khi chúng ở giai đoạn sâu non. Nó tiết ra các chất với mùi hôi khó chịu khi muốn  cảnh báo hơn nữa về tính thiếu hấp dẫn của chúng. Chính vì vậy mà chúng rất ít khi bị các loài khác tấn công, và vì thế nhiều loài đã chọn hình thái của chúng để bắt chước. Chúng thường thích hút mật hoa ở một số loài thuộc họ Cúc Asteraceae, Thầu dầu, cây ngọc nữ. Thỉnh thoảng chúng tới những mảng đất ẩm ướt, bay rất chậm, đường bay tương đối đơn giản và thẳng. Sâu ăn lá họ cây Phòng kỷ (Aristolochiaceae), họ dây leo có nhựa độc. Sâu và bướm có chất độc tích tụ trong cơ thể, khiến các động vật ăn côn trùng tránh chúng. Màu sắc cảnh báo (đỏ hồng phối hợp với đen) thể hiện tính chất này. Phổ biển trong rừng. Cũng có thể gặp ở các thành phố. Loài này gặp ở những nơi có thảm thực vật thứ sinh và bị hấp dẫn bởi các loài hoa của các cây bụi và cỏ dại. Chúng thường bay thấp và chậm, định hướng bởi các cây hoa và sử dụng cánh sau để giữ thăng bằng. Sâu non ăn lá cây thuộc chi Mộc hương, có độc tính đối với các loài chim cũng như đối với bướm trưởng thành. Chúng hơi giống loài bướm phượng Papilio polytes.', NULL, 'Sikkim, phía Bắc Miama, Trung Quốc và Thái Lan, Lào, Philipin, Việt Nam. Tên bướm được đặt theo mầu hồng của cánh.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2132, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Pachliopta', NULL, 'GEN_1419', 'pachlioptacoon', 'Pachliopta coon doubleddayi', '(Wallace 1865 )', '', 'SPA_02140', 'Đặc điểm nhận dạng:\n\nBướm đực và bướm cái giống nhau, cánh hẹp. Cánh sau có các đốm trắng ở giữa cánh và rìa cánh. Góc ngoài cánh sau có các đốm có màu vàng cam hơi đỏ ở mép ngoài, đuôi ở cánh sau thắt eo tạo thành một cuống rất mảnh và có màu đen. Bụng màu vàng chanh, phần gần gốc cánh có các đốm màu đen không đồng nhất. Ngực màu đỏ cam, phần đầu gần mắt kép có màu vàng chanh. Sải cánh: 80 - 100 mm.\n\nSinh học, sinh thái:\n\nLoài này thích độ cao trung bình và thấp. Chúng bay khá thấp và chậm. Thường gặp ở các khu rừng còn tốt và bay lượn ở khoảng trống trong rừng vào mùa khô. Có thể đây là loài bướm duy nhất trong họ Bướm phượng Papilionidae tìm thấy vào mùa khô ở các khu rừng miền Đông nam bộ. Bướm cái đẻ trứng và thức ăn của sâu non trên các loài thực vật thuộc họ Mộc hương Aristolochiaceae phân bố trong vùng loài này phân bố.', NULL, 'Loài phân bố rộng từ Ấn Độ, Java đến Thái Lan, Cambodia. Ở Việt Nam thường gặp từ Bắc vào Nam. Ở các tỉnh miền Đông Nam bộ Đồng Nai, Bình Phước, Tây Ninh thường gặp một vài cá thể vào mùa khô và loài này còn gặp Phú Quốc.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2133, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papilioalcmenor', 'Papilio alcmenor', 'C&R Felder, 1864', NULL, 'SPA_02141', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2134, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papilioarcturus', 'Papilio arcturus', 'Westwood, 1842', NULL, 'SPA_02142', 'có sải cánh dài khoảng 10-12cm, bướm cái lớn hơn bướm đực một chút và không có sự khác biệt rõ ràng về đặc điểm giới tính. Các xúc tu , đầu và ngực có màu đen, bụng cũng vậy. Bướm cái có cánh màu xanh đen với các sọc màu xanh lục bảo ở cả hai bên của mỗi vân cánh . Các cánh sau màu đen, có các vạch màu xanh lam, cuối cùng chuyển sang màu xanh lục và được bao phủ bởi 4 đốm màu tím hình hạt hình nhẫn. Cánh sau có màu xanh lục đậm với các mảng màu xanh sáng, cuối cùng chuyển sang màu vàng vàng với 4 điểm màu tím. Con bướm có màu đen trên lưng, với các sọc trắng ở cánh trước và 7 chuỗi đốm màu tím ở cánh sau', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(2135, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papiliobianor', 'Papilio bianor', 'Cramer, 1777.', NULL, 'SPA_02143', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2136, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papiliobootes', 'Papilio bootes', 'Westwood, 1842', NULL, 'SPA_02144', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2137, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papiliodemoleus', 'Papilio demoleus malayanus', '(Wallace 1865)', '', 'SPA_02145', 'Đặc điểm nhận dạng:\n\nLà loài bướm Phượng dễ phân biệt nhất trong tất cả các loài bướm. Cánh có nền đen và các đốm trắng xanh. Cuối mép cánh sau có một đốm đỏ lớn. Bướm cái hơi lớn hơn và các đốm ngả sang màu vàng hơn so với bướm đực. Đây là loài bướm khó có thể bị nhầm lẫn. Bướm đực và bướm cái giống nhau. Sải cánh: 80-100mm.\n\nSinh học sinh thái:\n\nPhổ biến khắp nơi, gặp quanh năm nhưng số lượng ít. Đẻ trứng trên các loài cây thuộc họ cam, chanh, quất và một số loài cây hoang dại khác. Sâu non tuổi nhỏ có màu sắc trông giống như phân chim, sâu lớn chuyển sang màu xanh với các đốm và vạch đen trên thân. Thường có màu xanh khi mới hoá nhộng, có màu như một đoạn cành cây khô khi sắp vũ hoá thành bướm. Chúng xuất hiện chủ yếu ở ven làng, vườn và công viên trong thành phố. Chúng bị hấp dẫn bởi một số cây hoa và cam chanh. Sâu non ăn một số cây thuộc họ Cam Rutasceae (các chi Cam, Chanh rượu, Quýt gai) và cả trên cây Táo - họ Táo Rhamnaceae và chi Phá cố chỉ - họ Đậu Fabaceae. ', NULL, 'Phân bố rộng rãi khắp nơi, cả trong các thành phố lớn. Phân bố phổ biến ở Srilanca, Ấn Độ đến Đông Dương và ở một số đảo thuộc quần đảo Sanda, New Ghine và Australlia. Đây là loài phổ biến ở khắp Việt Nam. Tên bướm được đặt do thường phổ biến trong các vườn cam, chanh.', NULL, NULL, 'Được coi là sâu hại trong ngành trồng trọt. Tuy nhiên chưa bao giờ thành dịch hại. Là loài có màu sắc đẹp sắc sỡ nên có thể nuôi với mục đích thu mẫu làm tiêu bản, làm tranh Đông hồ ghép cánh bướm để trao đổi, thương mại. Nhân nuôi chúng rất dễ dàng bởi cây chủ của chúng là cây trồng thuộc họ cam, chanh.', NULL, NULL, NULL, NULL),
(2138, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papiliodemolion', 'Papilio demolion demolion', '(Cramer [1776])', '', 'SPA_02146', 'Mặt trên cánh có màu đen nhung vùng giữa cách trước có 9 đốm màu xanh nhạt không đồng nhất nhỏ dần về phía chóp cánh. Giữa cánh sau là một mảng màu xanh nhạt kéo dài đến tận phần gốc cánh. Đuôi phượng kéo dài ở cánh sau có màu đen, vùng mép ngoài của cánh sau là nhửng đốm màu xanh nhạt. Mặt dưới cánh có màu đen bạc và 9 đốm màu xanh nhạt không đồng nhất nhỏ dần về phía chóp cánh. Vùng costal cánh trước có một dãy những gân cánh màu bạc kéo dài bắt đấu từ gốc cánh kéo dài đến vùng chót cánh và mờ dần, những gân cánh phí bên trong ngắn hơn. Cánh sau với 7 mảng màu trắng đen viền cam rất rõ. Đầu, râu, ngực, xúc biện và lưng màu đen nhung, bụng dưới màu trắng nhạt. Bướm bay rất nhanh và thường bị thu hút bởi chất thải của các loài thú rừng và thường tụ tập thành bầy để hút chất thải cùng với các loài khác ở các vũng nước đọng trong rừng. Loài này chỉ thấy xuất hiện ở các khu rừng còn tốt ở các tỉnh miền Đông nam bộ. Cây ký chủ của sâu non là các loài thuộc họ Cam Rutaceae - thuộc các giống Citrus sp.', NULL, 'Loài này phân bố ở Thái Lan, Cambodia. Ở Việt Nam loài này phân bố ở một số tỉnh phía Nam ở các khu rừng thường xanh thuộc Vườn quốc gia Cát Tiên, Bình Phước, Tây Ninh ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vncreatures'),
(2139, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papiliodialis', 'Papilio dialis doddsi', 'Janet', NULL, 'SPA_02147', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2140, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papiliodomeleus', 'Papilio domeleus linnaeus', '(Moore, 1886)', 'Bướm phượng vàng', 'SPA_02149', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2141, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papiliohamadeva', 'Papilio hamadeva', 'Moore, 1879.', NULL, 'SPA_02150', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2142, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papiliohelenus', 'Papilio helenus helenus', '(Linnaeus 1758)', '', 'SPA_02151', 'Rất giống với Papilio nephelus nếu nhìn thoáng qua. Màu đen, cánh sau có ba đốm trắng lớn. Gần góc ngoài cánh sau có một hoặc hai đốm màu đỏ hình trăng khuyết. Khi bay trông rất giống với loài Bướm Phượng đen bốn mảnh trắng Papilio nephelus, có bốn đốm trắng ở cánh sau, mặt trên cánh sau không có đốm đỏ; mặt dưới mép cánh sau có 8 đốm đỏ tròn với 1 chấm đen ở giữa xếp liên tục theo mép cánh, trong đó có 2 đốm nằm ngang nhau ở gần mép trong của cánh. Vài loài khác có kiểu màu sắc tương tự như Papilio noblei, Papilio prexaspes nhưng hiếm hơn nhiều. Sải cánh: 110 - 120mm. Loài này thường tụ tập hút chất khoáng ở ven suối cạn hay những vũng nước nhỏ trong rừng cùng với Papilio nephelus, Papilio protenor. Đôi khi gặp những cá thể đơn lẻ bay dọc theo các  con đường mòn trong rừng. Là loài khá phổ biến trong các khu rừng thường xanh còn tốt. Sâu non được ghi nhận là ăn một số thực vật thuộc họ Cam Rutaceae Cũng hay gặp từng cá thể đơn lẻ bay khá nhanh dọc các đường mòn trong rừng. Gặp khá phổ biến ở mọi độ cao trong rừng, quanh năm ở miền bắc (trừ đông giá) và mùa mưa ở miền Nam.', NULL, 'Phân bố rộng rãi trên toàn Việt Nam. Bắc Ấn Độ, Mianma, Thái Lan, Lào, Malaixia, Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'Vncreatures'),
(2143, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papiliomahadeva', 'Papilio mahadeva mahadeva', '(Moore [1879])', '', 'SPA_02152', 'Là loài nhỏ nhất trong giống Papilio ở Việt Nam. Mặt trên cánh trước có một đốm trắng nhỏ nằm ở chính giữa cánh với lớp phấn màu nâu cam phủ dọc theo gân cánh rất đặc trưng. Rìa cánh sau có 6 đốm màu trắng rất rõ, các đốm trắng này nhỏ dần vào phía trong, song song với các đốm trắng lớn là các đốm trắng nhỏ hình bán nguyệt. Bướm đực và bướm cái giống nhau. Mặt dưới cánh trước cũng có một đốm nhỏ nằm giữa cánh, mặt sau cánh là 7 đốm màu trắng khá rõ. Loài này thường tụ tập tập thành từng bầy hút chất khoáng ở ven suối cạn hay những vũng nước nhỏ trong rừng cùng với Papilio nephelus, Papilio protenor. Là loài khá phổ biến trong các khu rừng thường xanh còn tốt.  chúng bay chậm và thường có tập tính khi đậu vẫn còn đập cánh một lúc như các loài bướm phượng khác.', NULL, 'Xuất hiện mọi nơi ở miền Đông nam bộ, Việt Nam. Vùng phân bố từ Miến Điện, Thái Lan, Cambodia, Bắc Peninsular Malaya', NULL, NULL, NULL, NULL, NULL, NULL, 'Vncreatures'),
(2144, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papiliomemnon', 'Papilio memnon agenor', '(Linnaeus 1758)', '', 'SPA_02153', 'Mặt trên con đực có màu đen xanh dương sậm, mặt dưới ở phần gốc cánh trước và cánh sau có màu đỏ. Con cái có vài dạng khác nhau, một số con có đuôi, kiểu màu sắc bắt chước loài Pachliopta aristolochiae, tương tự con cái loài Papilio polytes nhưng lớn hơn rất nhiều. Mặt trên của con cái ở phần gốc cánh trước có màu đỏ, cánh sau có những mảng lớn màu trắng, không có đuôi ở cuối mép trong có màu đỏ da cam; ở con có đuôi có màu da cam chạy từ cuối mép trong đến hết mép ngoài cánh. Tên bướm được đặt theo kích thước lớn của cơ thể. Sải cánh 120-150 mm. Con đực có kích thước và màu sắc gần giống loài Bướm phượng xanh lớn Papilio protenor. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'UBND tinh Bac Kan'),
(2145, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papilionephelus', 'Papilio nephelus chaon', '(Westwood 1845)', '', 'SPA_02154', 'Là loài bướm phượng có kích thước lớn, có đuôi. Màu đen, cánh sau có bốm đốm trắng lớn. Khi bay trông rất giống với loài Bướm phượng đen ba mảnh trắng Papilio helenus, có ba đốm trắng ở cánh sau,nhưng ở góc ngoài mặt trên cánh sau không có đốm đỏ; mặt dưới mép cánh sau có các đốm vàng hoặc hơi trắng hình trăng khuyết. Vài loài khác có kiểu màu sắc tương tự như Papilio noblei, Papilio prexaspes nhưng hiếm hơn nhiều. Sải cánh : 105 - 130 mm. Thường tập trung thành từng đàn chung với loài Papilio helenus tại những khoảng trống có nước trong rừng. Cũng hay gặp từng cá thể đơn lẻ bay khá nhanh dọc các đường mòn trong rừng. Ở một số vùng loài này phân bố ở mọi độ cao và mọi nơi, nhưng phổ biến hơn ở các sinh thái cây bụi trảng cỏ và sinh thái nông nghiệp có độ cao dưới 700m.', NULL, 'Phân bố rộng rãi trên toàn Việt Nam. Ấn Độ, Mianma, Trung Quốc, Thái Lan, Lào, Malaixia, Việt Nam', NULL, NULL, 'Là loài bướm to, đẹp, tuy phân bố rộng trên toàn lãnh thổ Việt Nam nhưng số lượng cá thể thấp và cũng là loài hay bị thu bắt để làm bộ sưu tập, trao đổi buôn bán. Cần bảo vệ tốt nơi cư trú của chúng là rừng tự nhiên và hạn chế săn bắt. Đây cũng là một trong những loài bướm nên nhân nuôi trong trang trại.', NULL, NULL, NULL, 'Vncreatures'),
(2146, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papilionoblei', 'Papilio noblei noblei', 'de Niceville, 1889', 'Bướm Phượng Đốm Kem ', 'SPA_02155', 'Loài gần giống với Papilio helenus, nhưng trên cánh trước con đực không có vẩy thơm (androconia). Ngoài ra không có đốm đen vòng đỏ ở khoang cánh 2, mặt trên cánh trước với đốm trắng hình tam giác dưới ngay giữa mạch cánh 2. Hơn nữa góc cánh sau tròn hơn loài Papilio helenus. Loài giống với Papilio nephelus ở chỗ đều không có vẩy thơm, mặc dù Papilio nephelus có mảng trắng ở cánh trước kéo dài đến khoang cánh 4. Bay từ tháng 5 đến tháng 11 nhưng thường gặp vào tháng 6 và 7. Loài ghi nhận được ở các độ cao khác nhau trong rừng nguyên sinh và thứ sinh. ấu trùng 2 tuổi phát hiện ăn trên cây Zanthoxylum sp. và sau 23 ngày thì hoá nhộng, 10 - 12 ngày bướm vũ hoá.', NULL, 'Vĩnh Phúc (Vườn quốc gia Tam Đảo), đảo Cát Bà, Nghệ An (Khu bảo tồn Pù Hoạt, Vườn quốc gia Pù Mát), Thừa Thiên-Huế (Khu bảo tồn Ba Na), Quảng Trị (Khu bảo tồn Phong Điền). Mianma, Nam Trung Quốc, Thái Lan, Lào.', NULL, NULL, 'Loài hiếm và ít được biết đến. Có thể có một số chủng địa lý ở Việt Nam. Loài chỉ thị cho sự duy trì môi trường sống rừng nhiệt đới.', 'VU', NULL, NULL, 'vncreatures.net'),
(2147, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papilioparis', 'Papilio paris', 'Linnaeus, 1758', '', 'SPA_02156', 'Loài này về hình dáng rất giống với các loài Papilio bianor, Papilio arcturus. Nhìn thoáng qua thì loài này có màu đen với đốm xanh lục lớn ở mặt trên cánh sau, lấp lánh khi bay. Nếu quan sát thật gần, có thể thấy xen giữa các vảy màu đen là những vảy nhỏ li ti màu xanh lục khiến cho cánh con vật có màu đen nhung ánh xanh rất đẹ Papilio Mặt dưới cánh sau có một dãy các đốm đỏ tía hình trăng khuyết chạy dọc mép ngoài, hai đốm cuối cùng phía sát bụng biến thành hai vòng tròn đỏ với nhân đen to ở bên trong. Một trong những loài bướm Phượng có đuôi đẹp nhất ở Việt Nam. Bướm đực và bướm cái giống nhau và đều có một mảng lớn màu xanh lục ở cánh sau. Đặc điểm nhận diện loài Papilio paris dễ nhất là đốm màu xanh ngọc tương đối to, hơi tròn, rõ rệt không chạy tới sát mép ngoài của cánh sau. Sải cánh: 120-140mm (Thái Lan), và 100-130mm (ở Vân Nam). Phổ biến trong rừng hoặc gần rừng. Được ghi nhận đẻ trứng trên cây Ba gạc Euodia sp, họ Cam Rutaceae. Bướm bay rất nhanh tuy nhiên có thể gặp dễ dàng ở những bờ cát gần các con suối và sông. Bướm đực cũng thường gặp ở các thảm thực vật thứ sinh, trong khi đó nhìn chung bướm cái lại gặp ở trong rừng. Bướm bị hấp dẫn bởi phân thải của chim và thú. Vào mùa xuân, cả bướm đực và bướm cái cùng tụ tập với các loài bướm khác ở những cây thuộc họ chi Bướm bạc, Long não và những cây hoa khác.     ', NULL, ' Loài này phổ biến khắp nơi ở Việt Nam, riêng bướm cái có số lượng ít hơn. Ở Miền Nam cho đến nay chỉ ghi nhận được tại VQG Cát Tiên nhưng rất hiếm. Từ Đông Bắc Ấn Độ qua Trung Quốc đến Đài Loan và Nam Nhật Bản; Phía Nam qua vùng Đông Dương đến quần đảo San-đa', NULL, NULL, NULL, NULL, NULL, NULL, 'Vncreatures'),
(2148, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papiliopolyctor', 'Papilio polyctor', 'Boisduval, 1836', NULL, 'SPA_02157', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2149, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papiliopolytes', 'Papilio polites', 'Linnaeus, 1758', NULL, 'SPA_02158', 'Con đực có màu đen ở mặt trên với một loạt các đốm lớn màu trắng vàng chạy ngang cánh sau tạo thành một dải. Nữ có nhiều hình thức. Con cái bắt chước loài hoa hồng thông thường có độc để bảo vệ khỏi những kẻ săn mồi. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'National Parks Board'),
(2150, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Papilio', NULL, 'GEN_1437', 'papilioprotenor', 'Papilio protenor euprotenor', '(Fruhstorfer 1908)', '', 'SPA_02159', 'Mặt trên cánh trước có màu xanh đen với những viền màu bạc chạy dọc theo gân cánh, cánh sau những viền bạc chạy theo gân cánh rõ hơn cánh trước. Bướm đực và bướm cái giống nhau, phần mặt dưới cánh sau có những mảng màu đỏ sát mép cánh hình bán nguyệt. Một  mảng màu đỏ khá lớn nằm ở mặt ngoài, gốc cánh không có màu đỏ như Papilio menmon và nhỏ hơn Papilio menmon. Vùng mặt dưới cánh trước có màu xanh đen và một dãy những gân cánh màu bạc kéo dài bắt đấu từ gốc cánh kéo dài đến vùng chót cánh và mờ dần. Các con đực và con cái không có đuôi dài. Sải cánh:  100 -130mm. Có thể gặp ở những khu vực ngoại vi của các thành phố, nơi có vườn bưởi, một trong những loài cây chủ chính của loài này. Ở thành phố, thường chỉ gặp từng con đực đơn lẻ, thường bay khá nhanh, với mức độ dao động của đường bay lên xuống rất rộng, hoặc con cái bay chậm gần nơi có cây chủ. Ở trong rừng, loài này thường tụ tập hút chất khoáng ở ven suối cạn hay những vũng nước nhỏ trong rừng cùng với Papilio nephelus, Papilio menmon. Đôi khi gặp những cá thể đơn lẻ bay dọc theo các  con đường mòn trong rừng. Là loài khá phổ biến trong các khu rừng thường xanh còn tốt. Sâu non được ghi nhận là ăn một số thực vật thuộc họ cam Rutaceae', NULL, 'Xuất hiện mọi nơi ở Việt Nam Vùng phân bố từ Ấn Độ đến Thái Lan Cambodia', NULL, NULL, 'Là loài bướm lớn, đẹp có thể là đối tượng để nhân nuôi vì nhiều mục đích khác nhau. Dễ gặp chúng ở ngoài thiên nhiên hơn loài Papilio memnon nhưng Giá trị, tình trạng và biện pháp bảo vệ chúng cũng tương tự như loài này.', NULL, NULL, NULL, 'Vncreatures'),
(2151, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Parides', NULL, 'GEN_1476', 'paridesaidoneus', 'Parides aidoneus', 'Doubleday, 1845.', '  ', 'SPA_02160', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2152, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Parides', NULL, 'GEN_1476', 'paridespolyeuctes', 'Parides polyeuctes', '(Doubleday, 1842)', '  ', 'SPA_02161', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2153, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Parides', NULL, 'GEN_1476', 'paridesvaruna', 'Parides varuna', 'Pinratana & Eliot,1992', '', 'SPA_02162', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2154, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Pathysa', NULL, 'GEN_1487', 'pathysaagetes', 'Pathysa agetes', '(Westwood, 1843)', 'Bướm đuôi kiếm bốn vạch', 'SPA_02163', 'Con đực và con cái tương tự nhau về kích thước và màu sắc nhưng nhìn chung con đực vẫn nhỏ hơn con cái một chút. Mặt trên con đực: có ba dải đen chạy qua vùng trung tâm cánh trước, dải thứ nhất từ gốc kéo dài tới 1 và 1a, dải tiếp theo kéo dài đến gân 1, và dải cuối cùng thì kéo dài đến gân ở giữa; có một chấm hình tam giác ở phía trên đỉnh của vùng trung tâm, có một dải của vùng giữa gần mép cánh kéo dài từ góc trên xuống góc dưới cánh; mép ngoài và mép trong cánh được viền bởi một viền đen, khu vực đỉnh tam giác nằm bên cạnh mép ngoài ( chót cánh)  và dải giữa gần mép trong suốt và có màu vàng nhạt. Cánh sau: viền cánh ngoài rộng bao lấy điểm mép dưới cánh bằng dải màu vàng ở một bên của nó và có hình lưỡi gươm giống như đuôi của chúng. Mặt dưới: tương tự như mặt trên, thêm vào đó, cánh sau có hai dải đen xuất phát từ mép trên cánh, một đi qua vùng gốc cánh, một còn lại đi qua vùng giữa cánh hội tụ nhau ở mép dưới cánh, có một chấm đỏ của đường zíc zắc dọc theo dải giữa cánh gần mép. Sải cánh: 75-90 mm Là loài sống trong môi trường rừng tự nhiên nơi có bãi cát, sỏi, nơi ẩm, gần suối', NULL, 'Phân bố ở độ cao dưới 1.200m, ở các khu rừng thứ sinh và ở độ cao trên 700 còn bắt gặp ở các trảng cây bụi, thảm cỏ Sikkim, Mianma, Trung Quốc,Thái Lan , Lào và Việt Nam.', NULL, NULL, 'Đây cũng là một trong những loài thu hút sự chú ý của con người bởi chúng mảnh dẻ mềm mại và có màu sắc đẹp. Có thể sử dụng chúng làm hàng hoá, trao đổi, buôn bán', NULL, NULL, NULL, 'VN Creature'),
(2155, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Pathysa', NULL, 'GEN_1487', 'pathysaantipathes', 'Pathysa antipathes', '(Cramer, 1775)', '', 'SPA_02164', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2156, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Pazala', NULL, 'GEN_1489', 'pazalaalebion', 'Pazala alebion', '(Gray, [1853])', NULL, 'SPA_02165', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2157, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Teinopalpus', NULL, 'GEN_1921', 'teinopalpusaureus', 'Teinopalpus aureus', 'Mell, 1923', NULL, 'SPA_02166', 'Đặc điểm nhận dạng:\nLoài lưỡng hình ở hình dạng và kích cỡ cánh sau. Con đực có đuôi dài ở mạch cánh thứ 4, trong khi đó con cái có đuôi dài ở mạch cánh thứ 4, ngắn hơn ở mạch cánh thứ 6, ngắn hơn nữa ở mạch cánh thứ 2, 3 và 5. Con đực nhỏ hơn cái. Kiểu cánh giống loài Teinopalpus imperialis. Tuy nhiên loài này có đốm màu vàng chanh ở cánh sau con đực chiếm gần 1/3 buồng giữa; đường giữa cánh sau con cái gần thẳng.\nSinh học, sinh thái:\nThường thấy trên độ cao trên 1,500m. Con đực ưa thích đỉnh núi, trong khi đó con cái giới hạn ở nơi có nhiều loài cây họ Ngọc lan Magnoliaceae. Theo quan sát được ở Vườn quốc gia Bi Đúp - Núi Bà, con đực xuất hiện vào tháng 4 trên đỉnh núi ở độ cao khoảng 1,900m và từ 8.30 - 9.00 giờ sáng đến 11 - 12 giờ trưa. Vòng đời của loài bướm này hiện vẫn chưa biết.', NULL, 'Trong nước: Cao Bằng (Khu bảo tồn Pioac), Vĩnh Phúc (Vườn quốc gia Tam Đảo), Hà Tĩnh (Vườn quốc gia Vũ Quang), Lâm Đồng (Bi Đúp).\nThế giới: Đông Nam Trung Quốc (Đảo Hải Nam).', NULL, NULL, 'Loài hiếm và là hợp phần của quần xã bướm núi; Loài chỉ thị cho sự duy trì môi trường sống rừng nhiệt đới.', 'VU', NULL, NULL, 'vncreatures.net'),
(2158, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Troides', NULL, 'GEN_1996', 'troidesaeacus', 'Troides aeacus aeacus', '(C.&R. Felder [1865])', 'Bướm phượng cánh chim rời', 'SPA_02167', 'Là loài bướm vàng, đen với đầu đen, cổ đỏ, có những chấm đỏ trên cổ và ngực. Bụng có màu vàng ở phía dưới và màu vàng xen kẽ với màu đen ở phía trên. Con đực nhìn từ trên xuống thấy: Hai cánh trước màu nhung đen với đường viền hơi trắng vàng. Hai cánh sau màu vàng kim loại với viền màu đen cùng những hình tam giác thuộc mép cánh hướng đỉnh về phía gốc cánh; gần phía lưng những chấm đen hợp lại với nhau tạo thành đường viền biên bên trên nếp gấp phía bụng. Con cái nhìn từ trên xuống thấy: Hai cánh trước giống như ở con đực. Hai cánh sau cũng giống như con đực với sự cộng thêm một loạt các chấm đen bên trong và không dính liền với các chấm tam giác thuộc mép cánh. Con cái lớn hơn con đực. Sải cánh: 150 - 170mm. Loài này trong lúc bay nhìn rất giống loài Bướm phượng cánh chim chấm liền Troides helena Ở nước ta có thể gặp ở vùng rừng rậm, mưa nhiều. Loài bướm này thường bay ra vào lúc bắt đầu có ánh nắng buổi sáng và buổi chiều tà, chúng bay với tốc độ vừa phải, không cao và hay đậu trên các bụi cây có hoa. Do đó chúng rất dễ bị vào vợt của người sưu tầm. Người ta đã nhìn thấy chúng bay thành đôi để giao phối vào buổi hoàng hôn của mùa hè. ở Thái Lan người ta đã nhân nuôi giống Troides thành công.', NULL, 'Các vùng rừng ở Bắc Bộ và Trung Bộ: Bắc Kạn (Ba Bể), Vĩnh Phúc (Tam Đảo, Mê Linh), Ninh Bình (Cúc Phương). Đồng Nai (Cát Tiên, Mã Đà), Vũng Tàu (Núi Dinh), Chư Yang Sin, Konkakinh...  Ấn Độ, Nam Trung Quốc, Thái Lan, Lào, Malaixia.', NULL, NULL, 'Thẩm mỹ, là loài bướm được mua với giá đắt và được coi là thuộc các loài bướm đẹp nhất thế giới.', 'VU', NULL, NULL, 'vncreatures'),
(2159, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Troides', NULL, 'GEN_1996', 'troideshelena', 'Troides helena cerberus', ' (C.&R. Felder [1865])', 'Bướm phượng cánh chim liền', 'SPA_02168', 'Ở con đực nhìn từ trên xuống thấy: Đôi cánh trước màu nhung đen, với mép viền có màu hơi sáng. Đôi cánh sau phần lớn màu vàng rực rỡ với những chấm đen ở mép cánh; một hoặc vài chấm đen ở gần gốc cánh phía trước có thể bị cắt bớt. Con cái nhìn từ trên xuống thấy: Đôi cánh trước gần giống như ở con đực. Trên một phần của cánh sau, các chấm đen ở mép cánh có một hoặc một loạt chấm thuộc mép cánh trong không liền; Ngoài ra, một số chấm đen thuộc mép cánh ở vùng 2 và 3 không liên tục, những chấm còn lại dính liền với nhau, nhìn chung con cái lớn hơn con đực. Sải cánh: 140 - 170m. Loài này trong lúc bay nhìn rất giống loài Bướm phượng cánh chim chấm rời Troides aeacus Ở nước ta có thể gặp ở vùng rừng rậm, mưa nhiều. Loài bướm này thường bay ra vào lúc bắt đầu có ánh nắng buổi sáng và buổi chiều tà, chúng bay với tốc độ vừa phải, không cao và hay đậu trên các bụi cây có hoa. Do đó chúng rất dễ bị vào vợt của người sưu tầm. Người ta đã nhìn thấy chúng bay thành đôi để giao phối vào buổi hoàng hôn của mùa hè. Ở Thái Lan, Vườn bướm Bửu Long, Đồng Nai đã nhân nuôi 2 loài Troides helena, Troides aeacus thành công.', NULL, 'Gặp ở các vùng rừng ẩm nhưng không thường xuyên như: Vĩnh Phúc (Tam Đảo, Mê Linh), Ninh Bình (Cúc Phương), Quảng Trị (Tân Lâm), Đà Nẵng (bán đảo Sơn Trà). Đồng Nai (Cát Tiên). Ấn Độ (Sikkim), Mianma, Trung quốc, Thái Lan, Lào, Malaisia, Indonesia (Borneo).', NULL, NULL, 'Là loài bướm đẹp được các nhà sưu tầm ưa chuộng, các nhà buôn mua với giá cao và được đánh giá là một trong các loài bướm đẹp nhất thế giới.', 'VU', NULL, NULL, 'vncreatures'),
(2160, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Papilionidae', 'Bướm Phượng', 'FAM_272', 'Troides', NULL, 'GEN_1996', 'troidessp', 'Troides sp.', NULL, NULL, 'SPA_02169', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2161, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Appias', NULL, 'GEN_0136', 'appiasalbina', 'Appias albina', '(C.& R. Felder,[1865])', '', 'SPA_02170', ' con cái màu trắng hoặc vàng, có đốm đen ở đỉnh cánh trên. Cánh trước phía trên của con đực không có đốm đen sau đĩa đệm ở 3. Đỉnh F nhọn và có đuôi thẳng. Cánh trước phía trên của con đực có vảy màu đen ở đỉnh và gốc rất hẹp hoặc không có. Đỉnh cái luôn có 5 đốm; phía dưới mép trong của cánh trước vùng đỉnh sẫm màu không đều, có 5 khoảng nhạt rộng ở gốc. Con cái luôn có màu trắng ở trên: dạng thứ 2 màu vàng ở dưới.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'indiabiodiversity'),
(2162, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Appias', NULL, 'GEN_0136', 'appiasindra', 'Appias indra thronion', 'Fruhstorfer, 1910', NULL, 'SPA_02171', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2163, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Appias', NULL, 'GEN_0136', 'appiaslalage', 'Appias lalage lalage', '(DoubleDay, 1842)', NULL, 'SPA_02172', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2164, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Appias', NULL, 'GEN_0136', 'appiaslibythea', 'Appias libythea', '(Swinhoe 1890)', 'Bướm nâu gân cánh đen ', 'SPA_02173', 'Mặt cánh trên cánh trước ở con cái có màu trắng chóp cánh có một mảng màu đen khá lớn. Nằm giữa mảng màu đen này là ba đốm trắng đốm giữa rất rõ, hai đốm còn lại mờ. mặt trên cánh sau đồng nhất một màu trắng. Con đực mặt trên cánh cũng có màu trắng nhưng phần chót cánh là những mảng màu đen trắng rất rõ, rộng. Mặt dưới cánh là màu trắng với những vảy màu đen chạy dọc theo gân cánh. Con cái có màu sậm hơn con đực. Gốc mặt dưới cánh trước (cả đực và cái) đều có một mảng màu vàng nhỏ chạy từ gốc cánh. Loài này thường bay nhanh và dọc theo các con đường trong rừng. Chúng thường tụ tập cùng với các loài bướm khác thành từng đàn hút khoáng chất ở các khu vực có nước hay ẩm ướt trong rừng và từng cá thể hút mật hoa trên các loài thực vật có hoa như Thơm ổi Lantana camara, Bụp dấm, Cỏ lào ...Thức ăn của sâu non được ghi nhận là cây Màn màn tím Cleome chelidonii thuộc họ Màn màn Capparaceae mọc hoang ở rất nhiều nơi.', NULL, 'Ở Việt Nam loài này phân bố ở khắp các tỉnh trên toàn quốc ở thành phố, thôn quê và các công viên, vườn hoa. Trung quốc, Thái Lan. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(2165, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Appias', NULL, 'GEN_0136', 'appiaslyncida', 'Appias lyncida', '(Boisduval, 1836)', 'Bướm nâu lớn ', 'SPA_02174', 'Con đực có màu trắng ở mặt trên với viền đen  hoặc nâu sô cô la, và những nét trang trí màu vàng chanh sáng và màu nâu sô cô la. Con cái màu trắng xem kẽ với nhiều đám màu nâu tối. Loài thể hiện tính lưỡng hình theo mùa. Dạng mùa mưa: con đực: trắng ở phía trên với viền và gờ ngoài màu xanh nhạt hình răng cưa trang trí ở cánh trước. Cánh sau có viền răng cưa ở mép ngoài cánh, màu xanh nhạt viền phía trong. Mặt dưới có màu vàng sáng và mép viền ngoài màu sô cô la tối. Rất dễ nhận biết nhờ màu sắc đặc trưng của mặt dưới cánh sau và hình dạng cánh trước. Mặt trên màu trắng với viền cánh trước màu đen dạng răng cưa lớn, viền cánh sau màu đen. Con cái hiếm gặp, phần lớn cánh có màu đen và tối màu hơn nhiều. Sải cánh:55 - 70mm. Là loài bướm ưa rừng, thích những vùng đất mưa cao đến 3000 fít. Bay nhanh và nhanh chóng đỗ xuống mặt đất. Chúng thường chọn những khu rừng nhiệt đới, dọc theo bờ suối. Con đực thường thấy bay xung quanh các bụi rậm hoặc các cây. Chúng thường \"tụ họp\" với những loài khác, đôi khi bay thành từng đàn lớn. Thường ghé thăm những bông hoa như hoa cỏ roi ngựa....Thường xuất hiện chung với các loài khác thuộc họ bướm Phấn. Phổ biến, cả khu vực thành thị. Đẻ trứng trên cây bún Crataeva religiosa và Cáp gai nhỏ Capparis micrantha, Capparis roxburghii,  họ Màn màn Capparaceae. Sâu non có màu xanh hơi nâu, sâu tuổi cuối chuyển sang màu xanh và có hình dạng đặc trưng cho sâu của họ Pieridae. Loài này có nhiều ở rừng phục hồi thứ sinh và một số lượng lớn bướm đực có thể gặp đậu thành đàn ở những đám đất ẩm bên lề đường và dọc theo bờ suối. Bướm cái hiếm gặp hơn và thường phân bố hạn chế trong rừng. Loài này hầu như phổ biến ở những vùng đất thấp mặc dù có thể gặp chúng ở mọi độ cao.  ', NULL, 'Nam và Đông Nam Á: Ấn Độ, Xri Lanka, Mianma, Đài Loan, Hải Nam và Nam Trung Quốc, Malaixia, Indonexia, Philippin, Thái Lan, Đông Dương.  Nam và Đông Nam Á: Ấn Độ, Xri Lanka, Mianma, Đài Loan, Hải Nam và Nam Trung Quốc, Malaixia, Indonexia, Philippin, Thái Lan, Đông Dương. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(2166, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Appias', NULL, 'GEN_0136', 'appiasnero', 'Appias nero', '(Walace 1867)', '', 'SPA_02175', 'Hình dáng kích thước như A.lyncida nhưng khác xa về màu sắc. Không thể nhầm lẫn với màu cam đỏ đặc trưng ở mặt trên cánh. Con cái rất ít gặp, sậm màu hơn con đực và có viền đen rộng ở mép hai cánh và có những vằn đen loang lổ trên đỉnh cánh trước. Ở những con bướm đã bay lâu ngày, lớp vảy trắng ở mặt dưới cánh rụng mất, khiến cho con bướm có màu mặt dưới cánh trông sậm hơn so với những cá thể còn \"\"mới\"\". Sải cánh: 65-70mm.\nChủ yếu chỉ gặp trong rừng. Tập tính tương tự các loài khác trong giống Appias. Xuất hiện với số lượng lớn theo đợt vào các mùa mưa, mùa hè…Khá phổ biến, sống chủ yếu ở các rừng thứ sinh, trảng cỏ và khu nông nghiệp gần rừng.', NULL, 'Sikkim, Mianma, Trung Quốc, Thái Lan, Lào, Xingapo, Malaixia, Việt Nam. Phân bố rộng rãi trên toàn Việt Nam.\n\nGiống như với các loài cùng giống Appias, nhưng loài này có màu sắc khác thường và đặc biệt nhất do đó nên dùng vào việc làm các bộ sưu tập, làm tranh… sẽ rất đẹp và nổi bật.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(2167, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Appias', NULL, 'GEN_0136', 'appiaspandione', 'Appias pandione lagela', '(Moore, [1879])      ', NULL, 'SPA_02176', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2168, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Appias', NULL, 'GEN_0136', 'appiaspaulina', 'Appias paulina', '(Moore, 1905)', '', 'SPA_02177', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2169, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Appias', NULL, 'GEN_0136', 'appiassp', 'Appias sp.', NULL, NULL, 'SPA_02178', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2170, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Catopsilia', NULL, 'GEN_0332', 'catopsiliapomona', 'Catopsilia pomona pomona', '(Fabricius, 1775)', '', 'SPA_02179', 'Đặc điểm nhận dạng:\n\nMặt dưới màu trắng, vàng nhạt và phần rìa ngoài, trên cánh trước được viền bằng màu đen. Con đực đặc trưng bởi vệt giới tính hình oval ở gốc khoảng 7 ở mặt trên cánh sau, và lông màu chì gần gốc, lưng ở mặt dưới của cánh trước. Một trong những loài phổ biến nhất thuộc họ này. Đây là loài có nhiều dạng khác nhau. Dạng phổ biến và thường gặp nhất ở con đực là màu nền của cánh xanh đọt chuối. Con cái có nhiều dạng khác nhau, phổ biến nhất là dạng màu vàng nhạt ở mặt trên với viền đen ở mép cánh, mặt dưới cánh sau. Sải cánh: 55-80mm.\n\nSinh học sinh thái:\n\nVào mùa khô có thể gặp hàng đàn bay trong thành phố hoặc tập trung rất nhiều ở những vũng nước tại các khoảng trống trong rừng lẫn thành phố, phần lớn là con đực. Sự phổ biến của loài này, ngoài đặc tính di cư, còn liên quan đến sự phổ biến của loài cây chủ (các loài cây thuộc giống muồng Cassia , họ Đậu - Fabaceae). Loài này bay nhanh nhưng dễ nhận biết bởi màu sắc đặc trưng. Thường gặp nhiều ở vùng thấp có rừng thứ sinh hoặc khu vực gần nhà ở. Thông thường loài bướm này ở những vùng rừng có độ cao tới 1.500m. Bướm hay tụ tập ở những chỗ đất ẩm ướt dọc lề đường. Chúng có cánh khoẻ ,có thể gặp cả đàn lớn bay thẳng đứng lên.            ', NULL, 'Phân bố từ Ấn Độ qua Mianma, Thái Lan, Trung Quốc đến Đài Loan  và Nam Nhật Bản; phía Nam qua Đông Dương, Philippine và bán đảo Malaysia đến quần đảo Sanda; phía Đông đến Tân Ghi-nê và Australlia. Đây là loài phổ biến khắp nơi ở Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2171, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Catopsilia', NULL, 'GEN_0332', 'catopsiliapyranthe', 'Catopsilia pyranthe pyranthe', '(Linnaeus, 1758)', '', 'SPA_02180', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2172, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Catopsilia', NULL, 'GEN_0332', 'catopsiliascylla', 'Catopsilia scylla cornelia', '(Fabricius, 1787)', '', 'SPA_02181', 'Con trưởng thành dài khoảng 60–65 mm (2,4–2,6 in). Con đực có cánh trước màu trắng viền đen và cánh sau màu vàng cadmium , thường có các đốm đen ở rìa. Con cái cũng tương tự, nhưng có thêm một nhóm đốm đen ở cánh trước, chúng thường hợp nhất để tạo thành một vòng sẫm màu', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2173, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Cepora', NULL, 'GEN_0340', 'ceporaiudith', 'Cepora iudith lea', '(Boisduval, 1846)', '', 'SPA_02182', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2174, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Cepora', NULL, 'GEN_0340', 'ceporanadina', 'Cepora nadina', '(Lucas, 1852)', '', 'SPA_02183', 'Tương tự Cepora nerissa nhưng ranh giới mép trong của viền đen ở mặt trên cánh trước rõ ràng hơn. Mặt dưới cánh trước có màu trắng bao gồm từ vùng trung tâm đến mép cánh trong trừ mép trên, vùng chót cánh và mép ngoài cánh; mặt dưới cánh sau có màu vàng, vàng xám loang lổ, riêng vùng ô cánh màu sáng trắng. Có hai dạng bướm xuất hiện theo mùa có sự khác nhau về màu sắc mặt dưới. Những cá thể của dạng mùa khô nhạt màu hơn.Giống Cepora ở Việt Nam có 3 loài. Loài Cepora iudith, thường chỉ gặp với số lượng ít, dễ phân biệt với mặt dưới cánh sau màu vàng và mép cánh viền đen dày. Đối với con đực, giống Cepora và Appias có thể được phân biệt nhờ hình dạng cánh trước, trong khi con cái giống Appias đôi khi có cánh trước tròn và màu sắc hơi giống con đực giống Cepora. Mặt trên cánh con cái rất giống với loài Appias lyncida, Cepora nadina. Sải cánh: 55-65mm. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(2175, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Cepora', NULL, 'GEN_0340', 'ceporanerissa', 'Cepora nerissa dapha', '(Moore, [1879])', '', 'SPA_02184', 'à một loài bướm ngày kích thước trung bình thuộc họ Pieridae, có màu vàng và trắng', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2176, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Delias', NULL, 'GEN_0554', 'deliasacalis', 'Delias acalis', '(Godart, 1819)', '', 'SPA_02185', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2177, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Delias', NULL, 'GEN_0554', 'deliasagostina', 'Delias agostina annamitica', '(Fruhstorfer, 1901)', '', 'SPA_02186', 'Mặt trên màu trắng với các gân được rắc màu đen đặc biệt là ở vùng sát mép trên cánh trước và gốc cánh. Mặt dưới cánh trước được rắc màu đen dọc theo các gân, cánh sau màu vàng và các gân không được rắc màu đen, viền ngoài cánh màu đen rắc các đốm trắng. Sải cánh:64-78mm. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(2178, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Delias', NULL, 'GEN_0554', 'deliasbelladonna', 'Delias belladonna', '(Fabricius, 1793)', NULL, 'SPA_02187', 'có kích thước nhỏ, sải cánh nói chung nhỏ hơn 80mm, đốm vàng ở mặt trước cánh sau của bướm đực tương đối hoàn chỉnh, kéo dài đến mép cánh của góc', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(2179, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Delias', NULL, 'GEN_0554', 'deliasdescombesi', 'Delias descombesi descombesi', '(Boisduval, 1836)', '', 'SPA_02188', 'Đặc điểm nhận dạng:\n\nBướm cái và bướm đực khác nhau, bướm cái lớn hơn bướm đực. Mặt trên cánh trước con cái có màu đen thẫm, có 2 đốm trắng ở phần giữa cánh và các đốm nhỏ không đều ở phần mép cánh. Cánh sau có 2/3 là màu trắng, phần mép cánh màu đen. Mặt trên cánh trước và sau của con đực có màu trắng nhạt và chót cánh trước có một mảng màu đen. Mặt dưới cánh trước của con cái có màu xám đậm hơn ở con đực. Phần màu vàng chanh ở mắt dưới cánh sau con cái rộng hơn con cái, con cái có những mảng màu đen nhiều hơn con đực. Phần gốc cánh dưới cả đực và cái đều có một mảng màu đỏ rất rõ. Sải cánh:65-90mm.\n\nSinh học sinh thái:\n\nLoài này thường gặp chúng trong các khu rừng thường xanh, rừng phục hồi và các khu dân cư ở thành phố vào mùa mưa. Thường gặp nhiều cá thể tạo thành bầy hút mật ở các loài thực vật nở hoa. Chúng bay lang thang khắp nơi trong vùng phân bố để tìm kiếm thức ăn và bạn tình. Thức ăn của sâu non là vẫn chưa được xác định.', NULL, 'Vùng phân bố từ khắp vùng Ấn độ, Trung Quốc đến Thái Lan, Lào. Ở Việt Nam có mặt hầu khắp các vùng có rừng ở độ cao trên 600m trờ lên. Loài này gặp ở các tỉnh Cao nguyên Việt Nam như Lâm Đồng, Đắc Lắc, Kontum và Gia Lai.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2180, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Delias', NULL, 'GEN_0554', 'deliashyparete', 'Delias hyparete indica', '(Wallace, 1867)', '', 'SPA_02189', 'Mặt dưới ở bướm cái giống như ở bướm đực nhưng mặt trên tối màu hơn với các gân cánh hơi đen. Delias là giống bướm cỡ trung bình, đặc trưng bởi mặt dưới cánh sau ở nhiều loài có hai hoặc ba màu chính rất rõ rệt là vàng và đỏ, hoặc vàng và đen. Mặt trên cánh có thể trắng hoàn toàn có ánh hồng ở cánh sau cho đến trắng với các gân đen hoặc gần như đen hoàn toàn với các đốm vệt trắng hay vàng. Giống này rất dễ nhận diện với mặt dưới cánh sau không thể nhầm lẫn. Thường gặp trong thành phố. Vài cá thể khác có kiểu màu sắc mặt dưới cánh tương tự như D.pasithoe nhưng hiếm gặp hơn và chủ yếu chỉ phân bố ở vùng cao . Mặt dưới bướm cái giống như bướm đực nhưng mặt trên tối màu hơn với các cánh hơi đen . Sải cánh: 60 - 75mm. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(2181, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Delias', NULL, 'GEN_0554', 'deliaspasithoe', 'Delias pasithoe thyra', ' (Fruhstorfer, 1905)', '', 'SPA_02190', 'Bướm cái có cánh lượn tròn hơn và màu nâu hơn với các vết nhạt loang lổ, Đây là loài di cư chủ động, ở Việt Nam vào tháng 2 đến tháng 4 có thể gặp những con Bướm đơn độc bay thường xuyên qua cánh đồng lúa hoặc các làng bản lên phía Bắc. và đôi khi còn gặp chúng vào cuối tháng 10 hàng năm. Loài này khá bị hấp dẫn bởi những cây hoa khác nhau. Những vết vàng và đỏ ở mặt dưới của cánh sau giúp bảo vệ bướm trưởng thành tránh khỏi các loài chim. Hầu hết các loài ở giống này bay không nhanh nhưng cao; khi bay đi do hoảng sợ thì thường rất lâu sau mới chịu đậu. Các loài trong giống Delias đẻ trứng trên các loài cây thuộc họ Tầm gửi Loranthaceae . Đây là loài di cư chủ động, ở Việt Nam vào tháng 2 đến tháng 4, có thể gặp những con bướm đơn độc bay thường xuyên qua cánh đồng lúa hoặc các làng bản lên phía Bắc. Loài này khá bị hấp dẫn bởi những cây hoa khác nhau. Những vết vàng lúa và đỏ ở mặt dưới của cánh sau giúp bảo vệ bướm trưởng thành tránh khỏi các loài chim. Sâu non sống tập trung trên một số cây như Đại cán nam và Mộc vệ  họ Tầm gửi Loranthaceae. Ở Việt Nam, loài này có thể nhầm với bướm trắng D.acalis, loài này lớn hơn và hiếm hơn. Còn thấy loài này với số lượng lớn ở những cây sấu vào cuối xuân, đầu hè và đôi khi còn gặp chúng vào cuối tháng 10 hàng năm. Phân bố ở mọi độ cao và mọi môi trường, nhưng không có ở các khu rừng nguyên sinh ở độ cao trên 700m', NULL, 'ở Bắc và Trung bộ Việt Nam. Từ Nê pan và Bắc Ấn Độ đến Nam Trung Quốc, Hải Nam và Đài Loan, phía Nam qua Đông Dương và bán đảo Malaysia đến Sunderland và Phillipine. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(2182, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Dercas', NULL, 'GEN_0564', 'dercaslycorias', 'Dercas lycorias', '(Doubleday, 1842)', NULL, 'SPA_02191', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2183, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Dercas', NULL, 'GEN_0564', 'dercasverhuelli', 'Dercas verhuelli', 'Hoeven, 1839', NULL, 'SPA_02192', 'Sải cánh 60-70mm. Ăng-ten màu nâu đen. Đỉnh đầu là russet. Ngực đen, có nhiều lông màu vàng xám. Bụng màu vàng nhạt đến đỏ cam. Cánh trước màu vàng cam; mép trước rám nắng; góc đỉnh có một vết rám nắng lớn, hẹp dần dọc theo mép ngoài đến vân Cu2 và mặt trong của nó là góc M2; nó kéo dài xiên vào trong từ góc trong của góc đỉnh đến mép sau của cánh hình thành 1 dải màu đỏ cam; 1 điểm màu cam không rõ ràng ở đầu não thất. Đầu cuối của vân M3 ở cánh sau nhọn, đầu cuối của vân 2A cũng nhọn. Mặt dưới của cánh màu vàng nhạt, có các vạch giống như mặt trước, nhưng có màu nâu đỏ. Bướm cái không rõ ràng, góc đỉnh nhọn và nổi rõ hơn, không rõ các mảng màu đỏ cam ở mặt trước của cánh trước. Cơ quan sinh dục ngoài nam: quá trình hình móng vuốt dài, đầu nhọn; van xương đòn ngắn và rộng, hình tam giác, đỉnh tù, đầu phụ có 1 răng dày; quá trình hình túi mỏng, rất dài, đầu hơi to; dương vật khá mảnh, hơn chiều dài của quá trình hình thành cộng với phần nắp được kẹp chặt, không có quá trình bên cơ bản. Cơ quan sinh dục ngoài của con cái: Chiều dài của quá trình biểu bì trước và biểu bì sau gần như nhau; ống sinh tinh dày và dài, chiều dài gấp đôi chiều dài túi giao phối, túi giao phối lớn hơn; ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(2184, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Eurema', NULL, 'GEN_0693', 'euremaada', 'Eurema ada indosinica', '(Yata, 1991)', '', 'SPA_02193', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2185, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Eurema', NULL, 'GEN_0693', 'euremaandersonii', 'Eurema andersoni', '(Moore, 1886)', NULL, 'SPA_02194', 'Nam. Phía trên. Cánh trước có dải rìa ngoài rộng vừa phải, phần giữa hơi nghiêng vào trong và phần dưới hơi nghiêng xiên ra ngoài. Cánh sau có dải ngoài rộng vừa phải. Mặt dưới có các dấu hiệu thông thường được xác định một chút. Cánh trước có hai vết tế bào, ở gốc đã cũ. Nữ không thấy.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
(2186, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Eurema', NULL, 'GEN_0693', 'euremablanda', 'Eurema blanda silhetana', '(Wallace, 1867)', '', 'SPA_02195', 'Loài bướm nhỏ với cánh màu vàng chanh viền bằng màu đen, đặc biệt là ở mặt trên, có các đốm hoặc nét trang trí màu nâu đỏ ở mặt dưới. Con cái nhạt hơn với đường viền rườm rà rộng hơn ở cánh sau. Dạng mùa khô, các điểm trang trí lớn hơn và có nhiều màu nâu đỏ nhạt hơn ở mặt dưới. Ở mặt trên, viền đen thường hẹp đi. Eurema sp. là giống bướm nhỏ, có vài loài phổ biến và giống nhau, khó phân biệt khi quan sát. Mặt trên cánh màu vàng, viền cánh đen. Viền đen ở cánh trước rộng tại chót và góc ngoài cánh. Viền đen ở cánh sau mảnh hơn, đôi khi mất hẳn. Mặt dưới màu vàng có các vệt, đốm nhỏ màu nâu. Con cái thường có viền đen rộng hơn và màu xỉn hơn. Giống Eurema bay chậm và thấp, sát các bụi cỏ, rất thường gặp, đôi khi với số lượng lớn. Phổ biến khắp nơi. Sâu ăn lá các loại cây thuộc họ Đậu Fabaceae. E.blanda cũng được quan sát thấy đẻ trứng trên cả cây Mắc cỡ (Mimosa pudica). Loài này gặp ở độ cao khác nhau đến 2.000m. Đây là loài phổ biến ở những bìa rừng, những nơi trống trải, nhưng chủ yếu ở chỗ gần nơi có rừng. Những loài cây làm thức ăn cho loài Eurema blanda cũng là cây thức ăn cho loài khác thuộc giống Eurema sp.', NULL, 'có mặt khắp nơi ở Việt Nam. Phân bố hầu như khắp vùng Đông Phương và Australlia', NULL, NULL, 'Là một trong các loài rất phổ biến thuộc giống Eurema sp., chúng có màu vàng rất tươi mát nên mặc dù có kích thước nhỏ nhưng rất nổi bật và tô đẹp cho thiên nhiên. Trong bất kỳ một bộ sưu tập bướm nào nếu không có những mẫu của loài thì có thể nói đó là một bộ sưu tập chưa đầy đủ và thiếu một màu cơ bản. Màu sắc cánh của loài này rất cần trong việc ghép tranh bằng cánh bướm. Quần thể loài tuy còn phong phú nhưng nếu thảm thực vật mất đi nhất là thảm thực vật rừng không còn thì cũng đồng thời kéo theo sự mất đi của loài này.', NULL, NULL, NULL, 'vncreatures.net'),
(2187, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Eurema', NULL, 'GEN_0693', 'euremabrigitta', 'Eurema brigitta hainana', '(Moore, 1878)', '', 'SPA_02196', 'Eurema là giống bướm nhỏ, có vài loài phổ biến và giống nhau, khó phân biệt khi quan sát. Mặt trên cánh màu vàng, viền cánh đen. Viền đen ở cánh trước rộng tại chót và góc ngoài cánh. Viền đen ở cánh sau mảnh hơn, đôi khi mất hẳn. Mặt dưới màu vàng có các vệt, đốm nhỏ màu nâu. Con cái thường có viền đen rộng hơn và màu xỉn hơn Bay chậm và thấp, sát các bụi cỏ, rất thường gặp, đôi khi với số lượng lớn. Phổ biến khắp nơi. Sâu ăn lá các loại cây thuộc họ Đậu Fabaceae. Eurema hecabe cũng được quan sát thấy đẻ trứng trên cả cây mắc cỡ. Bướm này xuất hiện quanh năm ở khu vực trống trải và vùng cao. Bướm cái gặp nhiều hơn còn bướm đực thường tập trung với số lượng lớn ở những nơi ẩm thấp rỉ nước. Cây thức ăn cho sâu non là Keo dậu đầu, Sóng đắng và Bồ kết tây; Bồ cu vẽ thuộc họ Thầu dầu', NULL, 'Đây là loài phổ biến nhất ở Việt Nam. Phân bố ở độ cao dưới 800m trong các khu nông nghiệp, trảng cây bụi và còn sống trong các khu rừng thứ sinh ở độ cao dưới 700m Phân bố ở các vùng nhiệt đới châu Phi, Trung Đông, Xrilanca, Ấn Độ; phía Đông ngang qua Trung Quốc đến Nhật Bản, phía Nam, Philippin, Đông Phương và bán đảo Malaysia đến New Ghine và Australlia', NULL, NULL, 'Là loài bướm đẹp, có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
(2188, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Eurema', NULL, 'GEN_0693', 'euremahecabe', 'Eurema hecabe hecabe', ' (Linnaeus, 1758)', '', 'SPA_02197', 'Eurema là giống bướm nhỏ, có vài loài phổ biến và giống nhau, khó phân biệt khi quan sát. Mặt trên cánh màu vàng, viền cánh đen. Viền đen ở cánh trước rộng tại chót và góc ngoài cánh. Viền đen ở cánh sau mảnh hơn, đôi khi mất hẳn. Mặt dưới màu vàng có các vệt, đốm nhỏ màu nâu. Con cái thường có viền đen rộng hơn và màu xỉn hơn.Ở Việt Nam có 4 loài rất giống nhau và để phân biệt các loài này chúng ta dựa trên một số đặc điểm chính khác biệt như sau:\nỞ mặt trên, loài Eurema brigitta dễ nhận biết nhất với phần viền đen răng cưa dày, đậm màu bao quanh, ba loài còn lại khá giống nhau. Ở mặt dưới, ô gốc cánh của cánh trước là vị trí chuyên biệt nhất để phân biệt các loài với nhau, cụ thể: Eurema brigitta không có đốm đen trong ô còn gốc cánh trong khi Eurema blanda có ba đốm đen, Eurema hecabe và Eurema simulatrix cùng có hai đốm đen nhưng ở Eurema simulatrix còn có thêm một đốm tròn nhỏ ngay phía dưới vệt đen ở mép ngoài ô gốc cánh. Sải cánh Eurema hecabe: 45 - 50mm. Giống Eurema bay chậm và thấp, sát các bụi cỏ, rất thường gặp, đôi khi với số lượng lớn. Phổ biến khắp nơi. Sâu ăn lá các loại cây thuộc họ Đậu Fabaceae. Eurema hecabe cũng được quan sát thấy đẻ trứng trên cả cây mắc cỡ (Mimosa spp.). Bướm này xuất hiện quanh năm ở khu vực trống trải và vùng cao. Bướm cái gặp nhiều hơn còn bướm đực thường tập trung với số lượng lớn ở những nơi ẩm thấp rỉ nước. Cây thức ăn cho sâu non là Keo dậu đầu, Sóng đắng và Bồ kết tây; Bồ cu vẽ thuộc họ Thầu dầu Euphorbiaceae và cả một số cây họ Bứa Clusiaceae, Táo ta và Đậu Fabaceae.', NULL, 'Đây là loài phổ biến nhất ở Việt Nam. Phân bố ở các vùng nhiệt đới châu Phi, Trung Đông, Xrilanca, Ấn Độ; phía Đông ngang qua Trung Quốc đến Nhật Bản, phía Nam, Philippin, Đông Phương và bán đảo Malaysia đến New Ghine và Australlia.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(2189, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Eurema', NULL, 'GEN_0693', 'euremalaeta', 'Eurema laeta psuedolaeta', '(Moore, 1906)', NULL, 'SPA_02198', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
