(2191, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Eurema', NULL, 'GEN_0693', 'euremasimulatrix', 'Eurema simulatrix inouei', '(Shirozu & Yata, 1973)', '', 'SPA_02200', 'Eurema là giống bướm nhỏ, có vài loài phổ biến và giống nhau, khó phân biệt khi quan sát. Mặt trên cánh màu vàng, viền cánh đen. Viền đen ở cánh trước rộng tại chót và góc ngoài cánh. Viền đen ở cánh sau mảnh hơn, đôi khi mất hẳn. Mặt dưới màu vàng có các vệt, đốm nhỏ màu nâu. Con cái thường có viền đen rộng hơn và màu xỉn hơn.Ở Việt Nam có 4 loài rất giống nhau và để phân biệt các loài này chúng ta dựa trên một số đặc điểm chính khác biệt như sau:\nỞ mặt trên, loài Eurema brigitta dễ nhận biết nhất với phần viền đen răng cưa dày, đậm màu bao quanh, ba loài còn lại khá giống nhau. Ở mặt dưới, ô gốc cánh của cánh trước là vị trí chuyên biệt nhất để phân biệt các loài với nhau, cụ thể: Eurema brigitta không có đốm đen trong ô còn gốc cánh trong khi Eurema blanda có ba đốm đen, Eurema hecabe và Eurema simulatrix cùng có hai đốm đen nhưng ở Eurema simulatrix còn có thêm một đốm tròn nhỏ ngay phía dưới vệt đen ở mép ngoài ô gốc cánh. Sải cánh Eurema hecabe: 45 - 50mm. Giống Eurema bay chậm và thấp, sát các bụi cỏ, rất thường gặp, đôi khi với số lượng lớn. Phổ biến khắp nơi. Sâu ăn lá các loại cây thuộc họ Đậu Fabaceae. Eurema hecabe cũng được quan sát thấy đẻ trứng trên cả cây mắc cỡ (Mimosa spp.). Bướm này xuất hiện quanh năm ở khu vực trống trải và vùng cao. Bướm cái gặp nhiều hơn còn bướm đực thường tập trung với số lượng lớn ở những nơi ẩm thấp rỉ nước. Cây thức ăn cho sâu non là Keo dậu đầu, Sóng đắng và Bồ kết tây; Bồ cu vẽ thuộc họ Thầu dầu Euphorbiaceae và cả một số cây họ Bứa Clusiaceae, Táo ta và Đậu Fabaceae.', NULL, 'Đây là loài phổ biến nhất ở Việt Nam. Phân bố ở các vùng nhiệt đới châu Phi, Trung Đông, Xrilanca, Ấn Độ; phía Đông ngang qua Trung Quốc đến Nhật Bản, phía Nam, Philippin, Đông Phương và bán đảo Malaysia đến New Ghine và Australlia.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(2192, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Gandaca', NULL, 'GEN_0735', 'gandacaharina', 'Gandaca harina burmana', '(Moore, [1906])', '', 'SPA_02201', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2193, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Hebomoia', NULL, 'GEN_0828', 'hebomoiaglaucippe', 'Hebomoia glaucippe glaucippe', '(Linnaeus, 1758)', 'Bướm trắng lớn ', 'SPA_02202', 'Loài Hebomoia glaucippe là loài bướm lớn nhất trong họ bướm Phấn ở Việt Nam. Dễ nhận diện khi đậu với hai cánh trước hạ xuống rất thấp, cùng với kiểu màu sắc loang lổ ở mặt dưới cánh khiến con bướm cùng màu với nền đất có lá rụng. Cũng dễ nhận diện khi bay (dù nhanh) nhờ kích thước lớn và phần chót cánh trước có màu đỏ trên nền trắng. Ở con cái mép cánh sau có các đốm đen rõ rệt. Bướm cái có mặt trên màu trắng sữa và những đốm viền tối màu ở rìa cánh sau. Sải cánh: 80-100mm. Rất phổ biến. Sống trong trong rừng, thường gặp trường hợp cả đàn bất ngờ bay lên, màu trắng và cam đỏ nổi bật, từ một chỗ mà ban đầu ta tưởng chỉ có lá khô. Cũng có thể gặp bay sát ngọn cây cao dọc hai bên đường nhựa lớn trong rừng với tốc độ rất nhanh, phần màu đỏ ở mặt trên cánh trước thấp thoáng. Sâu ăn lá giống cây Cáp Capparis sp., họ Cáp Capparidaceae. Bướm này có kiểu bay nhanh theo đường zic zắc và thường bay khá cao. Tuy nhiên có thể dễ dàng gặp chúng tập trung cả đàn gần bờ sông và suối. Đây là loài phổ biến ở khu vực trống trải, bãi trống trong rừng và con đường làng, trên đỉnh đồi và thậm chí cả ở khu vực thành phố. Cây thức ăn thuộc họ Màn màn.     ', NULL, 'Phân bổ rộng rãi trên toàn Việt Nam nhưng chỉ gặp với số lượng lớn trong rừng theo mùa. Phân bố từ Srilanca, Ấn Độ đến Trung Quốc và suốt đến Mianma, Thái Lan và Đông Dương đến bán đảo Molucas và Philippin. ', NULL, NULL, 'Tuy không phải là loài quý hiếm nhưng to và đẹp, có lẽ nổi bật nhất trong họ Pieridae, lại đã biết rõ cây chủ của nó nên có thể nhân nuuôi loài này trong trang trại để phục vụ cho nhiều mục đích khác nhau. Là loài bướm đẹp tô điểm cho rừng và cũng là hàng hoá dễ trao đổi, thương mại nên cần được bảo vệ tốt, đặc biệt là bảo vệ nơi cư trú chính của nó là rừng tự nhiên.\n\n ', NULL, NULL, NULL, 'vncreatures.net'),
(2194, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Hemoboia', NULL, 'GEN_0860', 'hemoboiaglaucippe', 'Hemoboia glaucippe', 'Linnaeus, 1758', 'Bướm trắng lớn', 'SPA_02203', 'Đặc điểm nhận dạng:\n\nLoài Hebomoia glaucippe là loài bướm lớn nhất trong họ bướm Phấn ở Việt Nam. Dễ nhận diện khi đậu với hai cánh trước hạ xuống rất thấp, cùng với kiểu màu sắc loang lổ ở mặt dưới cánh khiến con bướm cùng màu với nền đất có lá rụng. Cũng dễ nhận diện khi bay (dù nhanh) nhờ kích thước lớn và phần chót cánh trước có màu đỏ trên nền trắng. Ở con cái mép cánh sau có các đốm đen rõ rệt. Bướm cái có mặt trên màu trắng sữa và những đốm viền tối màu ở rìa cánh sau. Sải cánh: 80-100mm.\n\nSinh học sinh thái:\n\nRất phổ biến. Sống trong trong rừng, thường gặp trường hợp cả đàn bất ngờ bay lên, màu trắng và cam đỏ nổi bật, từ một chỗ mà ban đầu ta tưởng chỉ có lá khô. Cũng có thể gặp bay sát ngọn cây cao dọc hai bên đường nhựa lớn trong rừng với tốc độ rất nhanh, phần màu đỏ ở mặt trên cánh trước thấp thoáng. Sâu ăn lá giống cây Cáp Capparis sp., họ Cáp Capparidaceae. Bướm này có kiểu bay nhanh theo đường zic zắc và thường bay khá cao. Tuy nhiên có thể dễ dàng gặp chúng tập trung cả đàn gần bờ sông và suối. Đây là loài phổ biến ở khu vực trống trải, bãi trống trong rừng và con đường làng, trên đỉnh đồi và thậm chí cả ở khu vực thành phố. Cây thức ăn thuộc họ Màn màn.  ', NULL, 'Phân bố từ Srilanca, Ấn Độ đến Trung Quốc và suốt đến Mianma, Thái Lan và Đông Dương đến bán đảo Molucas và Philippin. Phân bổ rộng rãi trên toàn Việt Nam nhưng chỉ gặp với số lượng lớn trong rừng theo mùa. Tên bướm được đặt theo kích thước và màu sắc của bướm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2195, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Hobomoia', NULL, 'GEN_0890', 'hobomoiaglaucippe', 'Hobomoia glaucippe', '(Linnaeus)', NULL, 'SPA_02204', 'là loài bướm lớn nhất trong họ bướm Phấn ở Việt Nam. Dễ nhận diện khi đậu với hai cánh trước hạ xuống rất thấp, cùng với kiểu màu sắc loang lổ ở mặt dưới cánh khiến con bướm cùng màu với nền đất có lá rụng. Cũng dễ nhận diện khi bay (dù nhanh) nhờ kích thước lớn và phần chót cánh trước có màu đỏ trên nền trắng. Ở con cái mép cánh sau có các đốm đen rõ rệt. Bướm cái có mặt trên màu trắng sữa và những đốm viền tối màu ở rìa cánh sau. Sải cánh: 80-100mm.', NULL, 'Phân bố từ Srilanca, Ấn Độ đến Trung Quốc và suốt đến Mianma, Thái Lan và Đông Dương đến bán đảo Molucas và Philippin. Phân bổ rộng rãi trên toàn Việt Nam nhưng chỉ gặp với số lượng lớn trong rừng theo mùa. Tên bướm được đặt theo kích thước và màu sắc của bướm.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=3&ID=274#:~:text=Lo%C3%A0i%20Hebomoia%20glaucippe%20l%C3%A0%20lo%C3%A0i,n%E1%BB%81n%20%C4%91%E1%BA%A5t%20c%C3%B3%20l%C3%A1%20r%E1%BB%A5ng.'),
(2196, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Ixias', NULL, 'GEN_0981', 'ixiaspyrene', 'Ixias pyrene', '(Linnaeus, 1764)', NULL, 'SPA_02205', 'Loài duy nhất trong giống Ixias có ở Việt Nam với các loài phụ khác nhau. Rất dễ nhận diện với màu sắc và kích thước không thể nhầm lẫn. Mặt trên cánh màu vàng, viền đen rộng, có một vùng lớn màu cam ở gần giữa cánh trước. Con cái có màu xỉn hơn và băng màu cam nhỏ hơn nhiều so với con đực. Loài này có hai dạng rõ rệt theo mùa. Dạng bướm mùa khô nhỏ hơn và mặt trên cánh sau không có đường viền đen, trong khi đó ở mặt dưới của cánh sau có những đốm nâu, ở giữa trắng. Bướm cái có một dải hẹp màu vàng hoặc hơi trắng. Sải cánh: 50 - 60mm. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(2197, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Leptosia', NULL, 'GEN_1062', 'leptosianina', 'Leptosia nina', '(Fabricius, 1793)', 'Bướm cánh chuồn', 'SPA_02206', 'Cánh trước trên có một đốm đen trên nền chủ yếu là màu trắng. Cánh sau có màu trắng với các vệt loang lỗ màu nâu. Động tác bay của chúng trông yếu ớt và thất thường và cơ thể của con bướm dịch chuyển lên xuống khi nó đập cánh. Chúng bay thấp trên cỏ và loài bướm này hiếm khi rời quá cao trên mặt đất.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2198, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Pareronia', NULL, 'GEN_1472', 'pareroniaanais', 'Pareronia anais anais', '(Lesson, 1837)', '', 'SPA_02207', 'màu nền là màu xanh nhạt trong suốt với tông màu đậm hơn nhiều so với P. avatar , Moore; tất cả các tĩnh mạch được xác định bằng màu đen. Cánh trước: cánh rộng, mép đỉnh và mép cuối có màu đen rất rộng, màu đen ở phần cánh trước thu hẹp về phía mép cánh, và chạy ngang qua một loạt các đốm trắng hơi xanh ở phần dưới cánh nằm ngang có số lượng thay đổi; vị trí ở khoảng giao thoa 3 dịch chuyển vào trong; đôi khi hai đốm sau của chuỗi đều được nối với nhau thành các vệt màu nền giữa các đường gân. Cánh sau: mép lưng và sườn có màu trắng rộng: mép cuối rộng màu đen, đặc biệt là ở đỉnh, vùng màu đen bao phủ, ngoại trừ ở phần gân, có vảy đặc biệt trông đục. Mặt dưới: màu xanh nhạt hơn, mép cuối của cánh có nhiều đốm mờ, chạy ngang qua một loạt các đốm hình liềm màu trắng nhạt nằm ngang ở gần đầu cánh, rất không rõ ràng. Cánh trước: các đường gân có viền rộng ít nhiều màu đen, viền này mở rộng về phía đầu cánh; đỉnh rộng, rìa cuối giảm dần đến hình xuyến, tràn ngập ánh sáng bóng như ngọc trai hơi mờ. Cánh sau: các gân dưới sườn và các gân 6, 7, 8 rộng, các gân còn lại viền rất hẹp màu đen; một đường màu đen rất mảnh ở khoảng cách 1. Lông mao của cả cánh trước và cánh sau rất hẹp và màu trắng. Râu đen, đầu, ngực và bụng có lông tơ, ngực có nhiều lông dài màu xanh lam; phía dưới: lòng bàn tay, ngực và bụng màu trắng bạc xanh nhạt', NULL, ' Nó được tìm thấy ở Ấn Độ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Pareronia_hippia'),
(2199, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Pareronia', NULL, 'GEN_1472', 'pareroniaparavatar', 'Pareronia paravatar', '(Bingham, 1907)', '', 'SPA_02208', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2200, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Pieris', NULL, 'GEN_1560', 'pieriscanidia', 'Pieris canidia', '(Sparrman, 1768)', NULL, 'SPA_02209', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2201, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Pieris', NULL, 'GEN_1560', 'pieriserutae', 'Pieris erutae', 'Poujade, 1888. ', NULL, 'SPA_02210', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2202, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Pieris', NULL, 'GEN_1560', 'pierisrapae', 'Pieris rapae', '(Linnaeus, 1758)', NULL, 'SPA_02211', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2203, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Prioneris', NULL, 'GEN_1624', 'prionerisphilonome', 'Prioneris philonome helferi', '(C.& R. Felder,[1865])', 'Bướm cánh gốc đỏ', 'SPA_02212', 'Bướm cái và bướm đực giống nhau. Mặt trên cánh trước có màu trắng với những gân cánh màu đen lớn dần ra ngoài rìa cánh và chóp cánh, Mặt dưới cánh trước có màu đen và những mảng màu trắng rộng. Mặt dưới cánh sau có những mảng lớn màu vàng cam và gốc cành sau có một mảng màu đỏ rất đặc trưng. Ở Việt Nam hiện nay chỉ có hai loài thuộc giống này là P.philonome và P.thestylis, cả hai đều rất dễ nhận diện khi đậu. Loài này khác với Prioneris thestylis: mặt dưới ở gốc cánh sau có một chấm đỏ nằm ở vùng 8 và khoảng hơn 2/3 diện tích cánh màu vàng, viền mép ngoài hầu như màu trắng. Kích thước tương đương loài Prioneris thestylis. Sải cánh:65-90mm. Loài này chỉ gặp chúng trong các khu rừng thường xanh có nhiều cây to và thường gặp những cá thể đơn lẻ, đôi khi chúng cũng tụ tập nhiều cá thể cùng với một số loài thuộc giống Papilio sp., Graphium sp. hút khoáng chất ở các vũng nước nhỏ trên các lối mòn trong rừng. Khi bị động chúng bay lên rất cao và đậu rất lâu ở trên đó và bay lượn nhiều vòng trước khi đậu xuống đất hút chất khoáng. Thức ăn của sâu non là một số cây thuộc giống Capparis họ Màn màn Capparaceae.', NULL, 'Ở Việt Nam có mặt hầu khắp các vùng có rừng. Vùng phân bố từ Mianma, Trung Quốc đến Thái Lan, Lào.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(2204, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Prioneris', NULL, 'GEN_1624', 'prioneristhestylis', 'Prioneris thestylis', 'Doubleday, 1842', '  ', 'SPA_02213', 'Đặc điểm giống Prioneris: mặt trên có đỉnh cánh trên kéo dài ra và gân 9 dài và nổi bật. Cánh của đa số con đực trắng nhưng gân được phủ màu đen đặc biệt là về phía góc trên và viền cánh trước. Mặt dưới của cánh trước có toàn bộ hoặc ít nhất là phần gốc màu trắng. Mặt dưới cánh sau toàn bộ màu vàng với các dải tối màu ở trên và dưới vùng trung tâm. Mặt trên của con cái có màu sẫm tro với những vệt trắng ở cánh trước, cánh sau cùng có nhiều vạch đốm trắng trên nền sẫm tro ngoại trừ một mảnh trắng vàng chạy dọc theo mép trong cánh về cuối càng loang sâu vào đĩa cánh. Ở Việt Nam hiện nay chỉ có hai loài thuộc giống này là P.philonome và P.thestylis, cả hai đều rất dễ nhận diện khi đậu. Bướm cái sẫm màu hơn còn mặt trên giống như một số loài thuộc giống Delias. Sải cánh:65-90mm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2205, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Pieridae', 'Bướm Phấn', 'FAM_288', 'Talbotia', NULL, 'GEN_1907', 'talbotianaganumpamsi', 'Talbotia naganumpamsi', NULL, NULL, 'SPA_02214', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2206, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Riodinidae', 'Bướm Ngao', 'FAM_323', 'Abisara', NULL, 'GEN_0003', 'abisaraabnormis', 'Abisara abnormis', 'Moore,[1884].', NULL, 'SPA_02215', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2207, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Riodinidae', 'Bướm Ngao', 'FAM_323', 'Abisara', NULL, 'GEN_0003', 'abisarabifasciata', 'Abisara bifasciata', '(Moore, 1877).', NULL, 'SPA_02216', 'Mặt trên có màu nâu giàu sắt. Cánh trước màu nâu sẫm ở bên ngoài; có một đốm đen nhỏ ở cận đỉnh không rõ ràng với con ngươi màu trắng; một con mắt màu đen phía dưới nổi bật rất lớn, với đồng tử lớn màu trắng, được bao quanh rộng rãi bên ngoài với màu đỏ tươi, màu sau này tạo thành một mảng đĩa đệm không đều kéo dài từ rìa sau và kéo dài về phía trước ở phía trước điểm cận chóp đến gần xương sườn. Cánh sau có bốn mắt nhỏ màu đen vừa phải giảm dần về phía trước với con ngươi màu trắng và các vòng ngoài màu đỏ sẫm đậm hơn. Cilia điện ảnh tối. Mặt dưới có màu nâu đỏ nhạt hơn, bên ngoài có màu nâu vàng hơn. Cả hai cánh đều có vùng cơ bản được đánh dấu bằng những đường sọc ngắn màu nâu sắt sẫm và có một đường đĩa ngang màu nâu đậm hơn rõ rệt, có đường viền màu son rộng ở bên ngoài ở đầu sườn ở phía trước và hẹp với đường màu điện ảnh ở phía sau trên cả hai cánh. Cánh trước có một đốm nhỏ ở dưới chóp và một mắt nhỏ ở giữa phía dưới, đôi khi cũng có một chấm trắng giữa gân giữa trên và giữa. Cánh sau có sáu mắt kính rất nhỏ, bốn mắt trên và mắt dưới nhỏ nhất.', NULL, 'Nó được tìm thấy ở châu Á', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Abisara_bifasciata'),
(2208, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Riodinidae', 'Bướm Ngao', 'FAM_323', 'Abisara', NULL, 'GEN_0003', 'abisaraburnii', 'Abisara burnii timaeus', '(Fruhstorfer, [1904])', NULL, 'SPA_02217', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2209, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Riodinidae', 'Bướm Ngao', 'FAM_323', 'Abisara', NULL, 'GEN_0003', 'abisaraecherius', 'Abisara echerius', '(Stoll, 1790)', NULL, 'SPA_02218', 'Mặt trên có màu nâu tím đậm hoặc nâu hạt dẻ với một chút ánh xanh. Cánh trước với các màng ngang đĩa đệm và sau đĩa đệm rất mờ và chỉ nhạt hơn màu nền một chút. Đồng phục cánh sau; hai đốm đen nhỏ hình nón hướng vào trong gần đỉnh của khoảng giao nhau 1, và các đốm đen đơn lẻ tương tự nhưng lớn hơn gần đỉnh của khoảng giao thoa 5 và 6; tất cả những đốm này đều có viền mảnh và hơi mờ ở mặt ngoài với màu trắng. Mặt dưới màu nâu sẫm. Cánh trước có đĩa đệm rộng, hơi cong, các dải màu nhạt ngang ở phần sau đĩa đệm và phần dưới đầu cuối hẹp hơn; màng đĩa đệm mở rộng về phía trước. Cánh sau: màng đĩa đệm hẹp hơi cong hơi cong; các đốm đen như ở mặt trên, nhưng được viền ở mặt trong và mặt ngoài bằng một đường hình mặt trăng mờ mờ. Ăng-ten màu đen có đốm nhạt rải rác; đầu, ngực và bụng màu nâu hạt dẻ; bên dưới, lòng bàn tay, ngực và bụng màu nâu nhạt.', NULL, 'được tìm thấy ở châu Á thuộc họ Punches và Judies (Riodinidae)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Abisara_echerius'),
(2210, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Riodinidae', 'Bướm Ngao', 'FAM_323', 'Abisara', NULL, 'GEN_0003', 'abisarafylla', 'Abisara fylla magdala', '(Westwood, [1851])', NULL, 'SPA_02219', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2211, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Riodinidae', 'Bướm Ngao', 'FAM_323', 'Abisara', NULL, 'GEN_0003', 'abisaraneophron', 'Abisara neophron chelina', '(Fruhstorfer, [1904])', '', 'SPA_02220', 'đều có đuôi mập hoặc nhọn đặc biệt ở cánh sau và sở hữu 2 hoặc nhiều đốm nổi bật gần đỉnh của cánh sau. Phần lớn có màu đất nâu đất, có màu hạt dẻ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
