(2215, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Riodinidae', 'Bướm Ngao', 'FAM_323', 'Dodona', NULL, 'GEN_0597', 'dodonaouida', 'Dodona ouida', '(Hewitson, 1865)', NULL, 'SPA_02224', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
