(2217, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Riodinidae', 'Bướm Ngao', 'FAM_323', 'Laxita', NULL, 'GEN_1038', 'laxitathuisto', 'Laxita thuisto ephorus', '(Fruhstorfer, [1904])', '', 'SPA_02226', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2218, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Riodinidae', 'Bướm Ngao', 'FAM_323', 'Paralaxita', NULL, 'GEN_1452', 'paralaxitadamajanti', 'Paralaxita damajanti', '(Felder and Felder, 1860)', '', 'SPA_02227', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2219, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Riodinidae', 'Bướm Ngao', 'FAM_323', 'Paralaxita', NULL, 'GEN_1452', 'paralaxitadora', 'Paralaxita dora', '(Fruhstorfer, [1904]) spp.', '', 'SPA_02228', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2220, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Riodinidae', 'Bướm Ngao', 'FAM_323', 'Paralaxita', NULL, 'GEN_1452', 'paralaxitasp1', 'Paralaxita sp.1', NULL, NULL, 'SPA_02229', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2221, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Riodinidae', 'Bướm Ngao', 'FAM_323', 'Paralaxita', NULL, 'GEN_1452', 'paralaxitatelesia', 'Paralaxita telesia', '(Hewitson, 1861) spp.', '', 'SPA_02230', 'Bướm có kích thước trung bình, bướm đực và bướm cái giống nhau. Mặt cánh trên có màu đỏ mận và các đường gân màu đen. Ở chót cách trước có một mảng màu trắng khá rộng, ở gần vùng gốc cánh trước là một mảng màu đen. Cánh sau cũng là sự kết hợp gữa hai màu đỏ mận và gân cánh đen. Ở phần chót đuôi cánh sau là một mảng màu đen kéo dài. Lưng màu đen tuyền, mắt màu đỏ, giữa mắt có một chấm đen. Mặt cánh dưới là những mảng chấm màu xanh, đen, không đều trên nên màu cánh đỏ đậm. Vùng chót đuôi của cánh sau là những vạch màu xanh lam, trắng đen và đỏ mận phân chia rất rõ và không đều. Sải cánh: 36-40mm. Loài này thường sống trong các khu rừng còn tốt ở độ cao thấp. Chúng thường xuất hiện vào những ngày trời có nắng và thường đậu ở những cây cỏ ven suối nước trong rừng. Bướm xuất hiện vào khoảng giữa và cuối mùa mưa hàng năm. Thức ăn của sâu non vẫn chưa được phát hiện.', NULL, 'Loài này phân bố ở các tỉnh miền Trung và miền Nam Việt Nam từ Lâm Đồng đến Đồng Nai và là loài hiếm gặp. Phân bố từ Borneo, Sumatra, Malaysia đến miền bắc Thái Lan', NULL, NULL, NULL, NULL, NULL, NULL, 'Vncreatures'),
(2222, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Riodinidae', 'Bướm Ngao', 'FAM_323', 'Stiboges', NULL, 'GEN_1863', 'stibogesnymphidia', 'Stiboges nymphidia', '(Guerin, 1843)', NULL, 'SPA_02231', 'Cánh trên của con trống có màu trắng tinh, gốc cánh hẹp, mép cánh trước rất rộng; với một phần ba đỉnh và một phần cuối của cánh trước và một phần ba cuối của cánh sau màu đen, mép trong của màu này có hình vòng cung không đều (hình vỏ sò). Cánh trước có các đốm trắng nằm ngang ở phần dưới và phần cuối rất không hoàn chỉnh, hai phần trước của loạt trước mang lại nhiều đốm trắng nhất. Cánh sau có một đường nhạt nhấp nhô ở phần dưới đầu, ở một số mẫu vật có màu trắng ở nơi nó chạy ngang qua các gân và một loạt các lunus màu trắng ở cuối. Cilia trắng xen kẽ với màu đen. Tương tự ở mặt dưới, các dấu vết nhìn chung được xác định rõ ràng hơn, đường dưới nhạt màu ở cánh sau được thay thế bằng một đường đốm nhỏ mờ mịt. Ăng-ten màu đen với các vòng màu trắng ở các khớp nối; đầu, ngực và bụng màu đen; bên dưới, lòng bàn tay và bụng màu trắng, ngực màu đen.\n\nCon cái tương tự như con đực, nhưng phần cánh trước với vùng đỉnh và phần cuối màu đen hẹp hơn tương ứng; cánh sau có nhiều đốm thay vì đường nhạt màu ở phần dưới cánh ở mặt trên. Râu, đầu, ngực và bụng giống như ở con đực', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2223, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Riodinidae', 'Bướm Ngao', 'FAM_323', 'Taxila', NULL, 'GEN_1918', 'taxiladora', 'Taxila dora', NULL, NULL, 'SPA_02232', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2224, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Riodinidae', 'Bướm Ngao', 'FAM_323', 'Zemeros', NULL, 'GEN_2071', 'zemerosflegyas', 'Zemeros flegyas flegyas', '(Cramer, 1780)', NULL, 'SPA_02233', 'Họ Riodinidae là những con bướm trông thanh mảnh, chúng có thể bị nhầm với họ Lycaenidae. Tuy nhiên, hầu hết họ Riodinids chủ yếu là mầu nâu và trắng. Giống như những con bướm mỏ dài, chân trước không hoàn hảo ở những con bướm đực nhưng hoàn hảo ở con cái. Loài Riodinid thông thường nhất Zemeros flegyas, được tìm thấy ở bìa rừng và những môi trường sống thoáng đãng trong suốt cả năm. Nó có thể được nhận ra bởi cánh của chúng có hình móc với các góc kiểu trang trí kiểu vỏ sò và bởi sở thích của chúng là đậu trên mặt lá cây với những cánh giương lên khoảng 45 độ so với mặt phẳng ngang.\nBướm đực và bướm cái giống nhau. Loài này có hai dạng theo mùa và tương đối khác nhau về kích thước và mầu sắc. Mặt trên có màu nền nâu tối với những chấm trắng nhỏ, mỗi chấm này được bao bọc bởi một chấm màu đen. Con cái có màu nhạt hơn. Sải cánh: 35-40mm. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(2225, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Saturniidae', 'Bướm Ma', 'FAM_327', 'Argema', NULL, 'GEN_0153', 'argemamaenas', 'Argema maenas', 'Doubleday 1847', 'Bướm đuôi dài xanh lá chuối', 'SPA_02234', 'Bướm lớn, thuộc loài bướm đêm, màu xanh lá chuối non, có đuôi dài. Kích thước sải cánh từ 180 - 190 mm. Con đực có anten dạng lược kép ngắn. Có đôi súc miệng ngắn có cùng màu với bàn chân trước. Con đực có anten ngắn hơn con cái có cùng hình dạng. Con đực nhỏ và thon, có sải cánh hẹp hơn con cái, đuôi con đực dài đuôi hơn con cái, ở cả con đực và con cái có bụng và gốc đều có lông dài, chân giữa nhiều lông nhưng ở con đực bàn chân giữa và bàn chân sau có 2 cựa Lúc đầu ấu trùng màu hồng, sau màu xanh phình to, trên phủ lông to, dài và có một số nốt sần lớn. Chúng ăn một loài cây Khế tàu. Khi thành nhộng có màu nâu, nằm cuộn trong lá được cuốn làm tổ', NULL, ' Miền Bắc Ấn Độ đến Malaixia, Java và Sulawesi', NULL, NULL, 'Đẹp về màu sắc lạ, về hình dáng, thường được ưa chuộng trong sưu tập', 'Bậc R', NULL, NULL, 'VN Creature'),
(2226, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Callerebia', NULL, 'GEN_0282', 'callerebianarasingha', 'Callerebia narasingha', '(Moore, [1858])', NULL, 'SPA_02235', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
