(2228, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Elymnias', NULL, 'GEN_0643', 'elymniascasiphone', 'Elymnias casiphone saueri', 'Geyer, [1827]', NULL, 'SPA_02237', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2229, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Elymnias', NULL, 'GEN_0643', 'elymniashypermnestra', 'Elyminas hypermnestra meridionalis', '(Fruhstorfer, 1902)', 'Bướm cau ', 'SPA_02238', 'Con đực và cái khác nhau. Người ta cho rằng con đực của loài này bắt chước kiểu màu sắc của giống Euploea  (Họ Danainae), với mặt trên màu nâu đen có các đốm tím ở cánh trước, mép cánh sau hơi ngả sang màu nâu. Con cái lại bắt chước kiểu màu sắc của giống Danaus (Họ Danainae), với mặt trên cánh có các màu cam, đen và trắng. Mặt dưới cánh có màu nâu sậm, loang lổ kiểu sắt gỉ. Mặc dù khi bay có thể nhầm lẫn, nhưng đi đậu, giống Elymias có thể dễ dàng  nhận diện nhờ mép cánh răng cưa rõ rệt, trong khi các loài thuộc Họ Danainae thì không. Cách bay của loài Elymnias hypermnestra mặc dù khá giống với Họ Danainae nhưng cánh đập gắt hơn. Loài này có màu sắc rất khác nhau. Cả bướm đực và bướm cái của quần thể phía Bắc Việt Nam khá giống nhau. Bướm cái của quần thể phía Nam khác bướm đực nhưng giống với con cái quần đảo phía Bắc. Sải cánh 60-80mm. Rất phổ biến, ngay cả trong thành phố, do sâu ăn lá những loài cây thuộc họ Cau Arecaceae, trong đó có nhiều loài cây cảnh, rất thường thấy đẻ trứng trên Cau cảnh vàng (Chrysalidocarpus lutescens). Cũng được coi là sâu hại thứ yếu của các loại cây trồng vì lý do trên [12]. Thường gặp chúng ở rừng tái sinh, làng quê hoặc trong vườn và công viên thành phố. Bướm đực cư trú theo lãnh thổ rõ rệt và tuần tra một vòng để ghép đôi. Sâu non ăn lá một số loài thuộc họ Cau bao gồm cả những cây trồng', NULL, 'Đây là loài phổ biến khắp nơi ở các nước trên và Việt Nam.  Phân bố từ Srilanca và Ấn Độ, phía Đông qua Nam Trung Quốc đến Đài Loan; phía Nam qua Đông Dương và bán đảo Malaysia đến Suntheland.', NULL, NULL, 'Vì sâu non loài này rất thích ăn cây họ cau - dừa, đặc biệt là cau cảnh, đôi khi gặm trụi hết  phần thịt của lá chỉ còn để trơ lại gân lá. Tuy nhiên mức độ hại chưa đến mức thành dịch lớn vì mỗi lần sinh sản loài này đẻ rất ít trứng, số sâu non nở ra không nhiều, nếu chú ý có thể giết nó bằng biện pháp cơ học, nhưng cần chú ý khi sâu non tuổi nhỏ rất giống với bọ nẹt, chúng có thể để lại trên da vết ngứa, đau nếu chạm vào chúng.', NULL, NULL, NULL, 'vncreatures.net'),
