(2235, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Erites', NULL, 'GEN_0668', 'eritesmedura', 'Erites medura rotundata', '(de Niceville, 1893)', '', 'SPA_02244', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2236, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Lethe', NULL, 'GEN_1070', 'lethechandica', 'Lethe chandica suvarna', '(Moore, [1858])', NULL, 'SPA_02245', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2237, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Lethe', NULL, 'GEN_1070', 'letheconfusa', 'Lethe confura', 'Aurivillius, 1897.', NULL, 'SPA_02246', 'Bướm đực và cái như nhau. Sải cánh : 45 - 50mm. Loài này gần giống với loài Lethe confusa tuy nhiên vân cánh và các đốm mắt không đều, sọc cánh hẹp hơn so với Lethe confusa. Tuy nhiên, vạch trắng xéo ở cánh trước và số lượng đốm mắt ở mặt ưới cánh trước là đặc điểm chính giúp phân loại hai loài này với nhau. Mặt trên loài Lethe confusa có vạch trắng xéo mảnh, hơi bo tròn, phần chót cánh có 2 chấm nhỏ màu trắng nhưng Lethe verma có vạch trắng xéo dày thẳng hơn và không có đốm trắng ở chót cánh. Mặt dưới Lethe confusa có 3 đốm mắt ở gần chót cánh trước, và một vạch trắng thẳng dài ở giữa hai cánh, trong khi loài Lethe verma tương ứng có 2 đốm mắt và vạch trắng mờ uốn lượn gợn sóng.', NULL, 'Vùng phân bố từ Sikkim và Nam Asam qua Mianma và Đông Dương đến bán đảo Malaysia và Sumatra. Đây là loài phổ biến hơn ở miền Bắc và miền Trung Việt Nam. Tên được đặt do có hai vạch chéo màu vàng trên mặt cánh.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=3&ID=265'),
(2238, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Lethe', NULL, 'GEN_1070', 'letheeuropa', 'Lethe europa gada', '(Fruhstorfer, 1911)', '', 'SPA_02247', 'Đặc điểm nhận dạng:\n\nĐặc điểm của Lethe: là một giống có số loài phong phú thuộc nhiều phân giống do sự khác nhau của gân và đặc điểm phụ của giới. Có lông mắt rậm. Gân 12 cánh trước không được mượt mà ở phần gốc ở một số loài. Hầu hết các loài có cánh sau có đuôi ở gân 4. Ở phía trên của các loài từ màu nâu tới màu nâu đỏ nhạt, và ở cả hai giới của một số loài và con cái của một số loài khác có một dải trắng, xiên, hoàn thiện hoặc bị phá thành các đốm ở cánh trước. Ở mặt dưới của cánh sau, mắt xuất hiện từ khoảng 1 đến 6, và một số loài nó bị tan ra. Có mặt trên màu nâu, có hai chấm trắng ở gần chót cánh trước. Mặt dưới có kiểu màu sắc phức tạp với các đốm mắt xếp thành một chuỗi ở gần mép ngoài hai cánh, một số đốm mắt không rõ ràng và thay đổi theo mùa. Cánh trước có một sọc trắng rộng và thẳng, chạy từ giữa bờ trước cánh nhập vào dãy đốm; ở con cái sọc này thấy ở cả mặt trên. Cánh sau có một đuôi ngắn. Sải cánh: 65-75mm.\n\nSinh học, sinh thái:\n\nẤu trùng ăn trên cây tre và con trưởng thành chủ yếu cặp đôi vào lúc sáng sớm hoặc khi đã tối. Loài E.europa thường được tìm thấy ở những chỗ đất rộng, bằng phẳng trong vườn những nơi gần người, nhưng hầu hết các loài khác đều được tìm thấy ở các khu rừng nhiệt đới, một số chỉ tìm được ở những đỉnh núi cao. Phổ biến, có thể gặp ở thành phố, những khu vực có cây bụi, bóng râm. Loài này bay thấp và nhanh, đường bay gắt, thay đổi hướng, khó quan sát. Thường chỉ gặp từng cá thể riêng lẻ. Giống Lethe có rất nhiều loài, hầu hết chỉ gặp dưới tán rừng. Cây thức ăn của chúng là tre, đặc điểm này đã được lấy để đặt tên cho nó.         ', NULL, 'Từ Sikkim đến Mianma, Thái Lan, Lào và Việt Nam. Phân bố toàn Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2239, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Lethe', NULL, 'GEN_1070', 'letheinsana', 'Lethe insana', '(Kollar, 1844).', 'Bướm mắt rắn rừng thường', 'SPA_02248', 'Đặc điểm nhận dạng:\n\nCó các đặc điểm của giống Lethe đã đề cập. Là một loài có kích thước nhỏ như L.confusa nhưng màu sắc mặt trên con đực gần giống với L.europa. Mặt dưới con đực: thẫm màu với các mắt tròn: 4 mắt ở khoảng giữa ô cánh và chót cánh trước xếp dọc gần như song song với mép ngoài cánh, 4 chấm này cùng với một đường sáng bắt đầu từ mép trên cắt ngang chạy về phía góc mép trong và ngoài cánh tạo thành một hình chữ V, ở cánh sau cũng có 6 mắt tròn rõ rệt với các kích cỡ khác nhau xếp theo nhau từ giữa mép trên cho đến hết mép ngoài cánh. Sải cánh : 45-50mm.\n\nSinh học sinh thái:\n\nLoài này thường xuất hiện vào ban sáng sớm hay buổi chiều tối, thức ăn của sâu non là loài Arumdianaria falcuta thuộc họ Cỏ Poaceae. Phân bố ở độ  dưới 1.200m, trong các khu rừng và các bụi cây, trảng cỏ, hang động...\n\n', NULL, 'Nam Trung Quốc, Lào, Việt Nam loài này ở hầu khắp các tỉnh phía Bắc từ Lạng sơn cho đến Cúc Phương.', NULL, NULL, 'Phân bố hẹp hơn và ít gặp hơn so với các loài khác thuộc giống Lethe.', NULL, NULL, NULL, 'vncreatures.'),
