(2247, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Lethe', NULL, 'GEN_1070', 'letheverma', 'Lethe verma', 'Doubleday, 1849', 'Bướm nâu có dải thẳng', 'SPA_02256', 'Đặc điểm nhận dạng:\n\nLà loài khác hẳn với đa số loài thuộc giống Lethe về hình dáng, màu sắc ở cả mặt trên lẫn mặt dưới. Loài bướm mắt rắn năm mắt Lethe syrcis có kích thước thì cũng tương tự như loài Lethe philemon, Lethe gulnihal, Lethe verma. Màu nền mặt trên bướm đực có màu nâu sáng với các nét trang trí. Cánh trước có hai dải màu nâu tối chạy ngang gần như song song với mép ngoài có xuất phát điểm từ mép trên và kết thúc ở mép dưới cánh. Dải màu nâu tối thứ nhất nằm sát mép ngoài và dải thứ 2 song song với dải 1 nằm ở vị trí khoảng 1/3 độ dài cánh gần phía mép ngoài cánh. Do đó, màu sắc mặt trên cánh đã bị chia làm 3 khoảng theo bề ngang của cánh. Mặt trên cánh sau cũng có màu nền nâu sáng và có mức độ sáng tối khác nhau: nửa gần gốc cánh có màu tối hơn, nửa gần mép ngoài cánh nhìn rõ đường viền sát mép ngoài có màu nâu tối và nằm phía trong được nó bao bọc là 4 mắt đen to, tròn rõ rệt với kích thước tương đương nhau, cánh sau có đuôi hơi nhú như đuôi loài Lethe verma. Mặt dưới con đực: ở cánh trước tương tự mặt trên nhưng xuất hiện một dải nâu tối mảnh chạy ngang cánh nằm giữa dải 2 và gốc cánh và chia mặt dưới cánh ra làm 4 khoảng. Điều quan trọng là dải thứ 3 mảnh ở cánh trước này như thể tiếp tục chạy ngang sang mặt dưới cánh sau nên đã làm cho hoa văn của cánh sau thêm độc đáo, dải mảnh đó chạy từ mép trên sang mép phía trong rồi quay ngược trở lại mép trên với dải ríc rắc và bao bọc 5 mắt, trong đó có 2 mắt có viền đen nhìn rõ. Đặt biệt loài này khác nhiều loài thuộc giống Lethe ở chỗ mặt dưới của cánh sau chỉ nhìn thấy có 5 mắt trong khi đó đa số các loài có 6 mắt rõ rệt.\n\nSinh học, sinh thái:\n\nLoài này xuất hiện ở các khu rừng tự nhiên còn tốt ở phía Bắc và thường thấy ở các kiểu rừng tre, nứa ven suối.       \n\n', NULL, 'Lào, Việt Nam. Ở Việt Nam phân bố ở Cúc Phương, Tam Đảo. Phân bố ở mọi độ cao, trong các khu rừng, trảng cây bụi và thảm cỏ.', NULL, NULL, 'Phân bố thế giới hẹp và ở Việt Nam hẹp nên loài này không chỉ hiếm đối với nước ta mà còn hiếm với thế giới nữa.', NULL, NULL, NULL, 'vncreatures.'),
(2248, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Lethe', NULL, 'GEN_1070', 'lethevindhya', 'Lethe vindhya vindhya', '(C. & R. Felder, 1859)', NULL, 'SPA_02257', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2249, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mandarinia', NULL, 'GEN_1157', 'mandariniaregalis', 'Mandarinia regalis', '(Leech, 1889).', NULL, 'SPA_02258', 'Mặt trước của các cánh màu nâu, và các cánh trước có dải xiên màu xanh lam từ 2/3 phía trước của mép trước đến góc gốc. Dải xiên của bướm đực rất rộng và thẳng, dải xiên của bướm cái hẹp và hình vòng cung, ở khoang giữa của cánh sau có một vệt lông dài màu nâu đen. Có hai đường kẻ mảnh gấp nếp ở mép ngoài của mặt dưới của cánh trước, và năm điểm mắt màu đen ở mặt trong của các đường kẻ. Mặt sau của cánh sau có một đường mảnh gấp nếp giống như cánh trước, với sáu đốm đen giống mắt ở mép ngoài phụ và một vòng màu vàng xung quanh mép ngoài. Bướm cái màu xanh lam.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.'),
(2250, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Melanitis', NULL, 'GEN_1193', 'melanitisleda', 'Melanitis leda leda', '(Linnaeus, 1758)', '', 'SPA_02259', 'Giống Melanitis là giống bướm lớn với cánh trước cong hình lưỡi liềm nhiều hoặc ít ở gân 5 và cánh sau có đuôi ở gân 4. Ở cánh trước không có gân nào phồng lên ở gốc. Dạng mùa khô có con trưởng thành lớn hơn, cánh góc cạnh hơn ở cả hai giới, vùng sát mép trên màu cam phát triển ở cánh trước và mặt sau có màu khó miêu tả. Các loài của nó hoạt động vào sáng sớm hoặc gần tối, thường bị thu hút vào các ngôi nhà vì ánh sáng. Ấu trùng của nó ăn cây của họ Gramineae, bao gồm cả tre. Xuất hiện ở Châu phi cho tới phương Đông. Loài Melanitis leda: Mặt trên cánh màu nâu, có một đốm mắt kép lớn ở phần gần chót cánh, mặt dưới có màu sậm,kiểu màu phức tạp và thay đổi. Dạng mùa mưa có các đốm mắt ở mặt dưới cánh rõ ràng và khá ổn định ở từng cá thể. Ở dạng mùa khô, các đốm mắt tiêu giảm hoặc biến mất, mặt dưới cánh rất thay đổi, thường nhìn thấy 5 mắt tròn với kích cỡ khác nhau được bài trí theo sát mép ngoài cánh sau, gần như không có hai cá thể có mặt dưới cánh giống nhau. Bướm đực và bướm cái ở cả hai mùa giống nhau. Mặt dưới cánh thay đổi rất giống mảnh lá. Melanitis leda được coi là phổ biến nhất trong giống này.Sải cánh: 60-80mm. Được coi là sâu hại thứ yếu của cây nông nghiệp, vì sâu ăn lá cây họ Cỏ Poaceae, trong đó có lúa Ozya sativa. Con cái thường đẻ trứng lúc gần tối, có thể thấy nó bay gần các bụi cỏ để tìm chỗ đẻ trứng. Ban đêm thường hay bay vào đèn [12]. Chúng xuất hiện quanh năm ở tất cả những nơi thích hợp nhưng chủ yếu ở vùng thấp. Bướm thường hoạt động tích cực vào trước và sau khi mặt trời lặn, chúng bay nhanh và thất thường, bay vào ánh sáng đèn trong nhà. Vào thời gian mùa khô bướm trưởng thành có thể khá phổ biến ở những khoảng rừng trống. Sâu non ăn lá câu thuộc họ Cỏ Poaceae bao gồm cả Lúa. ', NULL, ' Phân bố của loài này có phạm vi địa lý rất rộng, từ châu Phi đến Australlia, Ấn Độ, Mianma, Trung Quốc, Thái Lan, Lào, Malaixia, Bocneo, Xumatra. Phổ biến ở các nước trên và Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(2251, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Melanitis', NULL, 'GEN_1193', 'melanitisphedima', 'Melanitis phedima ganapati', '(Fruhstorfer, 1908)', '', 'SPA_02260', 'Nhìn thoáng loài này rất giống với Melanitis leda. Ở loài này và ở Melanitis zitenius, vùng đen ở khoảng 3 ở cánh trước nếu có, thì sẽ là hình chữ nhật với một đốm trắng to gần phía rìa ngoài và một đốm trắng nhỏ nằm phía trong. Ở mặt dưới của cánh sau có 6 mắt rắn rất nhỏ ở cả hai dạng mùa. Ở mùa mưa, dạng của con đực có màu hơi nâu, cánh trước hơi cong và đuôi ở cánh sau, và vùng đen ở khoảng 3 không có hoặc rất nhỏ, con cái có màu nâu nhạt hơn, với những khu vực màu đen và màu trắng ở khoảng 3 rộng hơn. Vào mùa khô, dạng của cánh nhìn rất góc cạnh, vùng cam ở phía trên cánh trước cũng như vùng trắng ở khoảng 3,4 rất nổi bật, và vùng rìa ngoài dọc cánh của cả hai cánh có màu xám tro, đặc biệt ở con cái. Ở mặt dưới, mắt không còn nữa. Sải cánh: 65-75mm. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'UBND tinh Bac Kan'),
(2252, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Melanitis', NULL, 'GEN_1193', 'melanitiszitenius', 'Melanitis zitenius', '(Herbst, 1796)', '', 'SPA_02261', 'Cánh trước: cánh cong mạnh, đỉnh nhọn; có tận cùng ngay dưới đỉnh ở hình con đực, ở hình lưỡi liềm ở con cái (hình liềm). Mặt trên giống M. ismene , nhưng màu nền trên toàn bộ màu nâu ấm hơn, một mảng màu vàng son rất rộng, phía trên và ngoài các đốm đen cận đỉnh, ở con cái lớn hơn ở con đực. Mặt dưới có nhiều vết khía (rắc) với các đường (đường) màu nâu sẫm; các ocelli nhỏ hơn rất nhiều và ít được xác định rõ ràng hơn ở M. ismene ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2253, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesisadamsonii', 'Mycalesis adamsonii adamsonii', 'Watson, 1897', NULL, 'SPA_02262', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2254, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesisanapita', 'Mycalesis anapita', 'Moore, 1857 ', '  ', 'SPA_02263', 'Mặt dưới màu nâu cam. Các cạnh của cánh trước và cánh sau có những đường màu nâu gỉ với khoảng 11 đốm mắt dọc theo mép cánh. [1] Mặt trên từ đỉnh đến mép có màu nâu cam đậm với viền cánh trước màu đen', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2255, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesisanaxias', 'Mycalesis anaxias aemate', '(Fruhstorfer, 1911)', '', 'SPA_02264', 'Mặt trên màu nâu Vandyke xỉn, ở con cái nhạt màu hơn; các nếp nhăn ở phần dưới và phần cuối ở cả hai cánh trước và cánh sau có màu sáng (màu hung): lông mao màu nâu. Cánh trước có một dải ngắn màu trắng xiên trước đỉnh, không chạm tới xương sườn hoặc xương đuôi. Mặt dưới: cánh trước: vùng cơ bản lên đến dải màu trắng và theo đường ngang từ đầu dưới của dải đến mặt lưng, màu nâu đen; rìa cuối cùng có màu nâu nhạt hơn; một con mắt tròn màu đen có điểm sáng ở giữa màu trắng ở giao điểm 2, và hai con mắt nhỏ tương tự ở đầu, nhỏ hơn, tiếp theo là một đường dưới rất ngoằn ngoèo và một đường màu nâu đậm ở đầu cuối thẳng hơn. Cánh sau: 2/3 phần cơ bản có màu nâu đen, viền ở phần cuối nhạt màu hơn, thường có bảy mắt tương tự như ở cánh trước, và các đường màu nâu sẫm ở phần cuối và phần cuối', NULL, 'được tìm thấy ở Nam và Đông Nam Á ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Mycalesis_anaxias'),
(2256, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesisannamitica', 'Mycalesis annamitica mausonia', 'Fruhstorfer, 1906', NULL, 'SPA_02265', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2257, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesisdeficiens', 'Mycalesis deficiens deficiens', 'Fruhstorfer, 1906', NULL, 'SPA_02266', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2258, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesisfrancisca', 'Mycalesis francisca', '(Stoll, [1780])', '  ', 'SPA_02267', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2259, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesisgotama', 'Mycalesis gotama charaka', 'Moore,1875', NULL, 'SPA_02268', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2260, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesishorsfieldi', 'Mycalesis horsfieldi mucianus', ' (Fruhstorfer, 1908)', '', 'SPA_02269', 'Màu nâu ở cả hai bề mặt cánh và được đánh dấu bằng một loạt các lông mày dễ thấy và một đường trung tuyến thẳng duy nhất chạy qua mặt dưới của cả hai cánh. Các loài ở vùng đất thấp, được tìm thấy ở các khu vực trống của rừng nguyên sinh và rừng thứ sinh, bao gồm dọc theo bờ sông, ven đường, đường ray xe lửa, khoảng trống, vườn và những nơi có cỏ khác.', NULL, ' Đông Nam Á', NULL, NULL, NULL, NULL, NULL, NULL, 'Jungledragon'),
(2261, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesisinopia', 'Mycalesis inopia', 'Fruhstorfer, 1908.', NULL, 'SPA_02270', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2262, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesisintermedia', 'Mycalesis intermedia', 'Moore, 1892', 'Bướm Bụi Nâu Đen ', 'SPA_02271', 'Bướm cái hơi lớn hơn, nhạt màu hơn và có thể phân biệt bởi không có dải (chùm vảy đặc biệt) ở mặt trên của cánh sau. Đây là loài gặp theo từng nơi ở vùng đất thấp đặc trưng. Chúng thường xuất hiện dưới tán cây bụi và hoạt động tích cực suốt ngày và rất thích sống gần các bụi cây tre, trúc khi phát măng. Cả bướm đực và bướm cái bay rất gần mặt đất. Chúng thường bị hấp dẫn bởi phân động vật, nước ở các ngọn măng tre, trúc tiết ra. Có một số loài tương tự ở Việt Nam, đó là Mycalesis perseoides, Mycalesis perseus, Mycalesis intermedia, dạng bướm mùa khô của loài này chỉ có thể phân biệt qua cấu tạo bộ phận sinh dục đực. Giống Mycalesis  bay thấp, gần các đám cỏ ven đường mòn. Ba loài khá giống nhau là M.mineus, M.perseus và M.perseoides, có thể phân biệt dựa vào các đốm ở mặt dưới cánh nhưng không dễ. Việc định danh chính xác phải dựa vào cấu trúc cơ quan sinh dục của con đực. M.mineus và M.perseoides là những loài phổ biến. Chúng thường xuất hiện dưới tán cây và hoạt động tích cực suốt ngày. Cả bướm đực và bướm cái bay rất gần mặt đất. Chúng thường bị hấp dẫn bời phân động vật. Có một số loài tương tự ở Việt Nam, đó là M.perseoides, M.zonata, M.intermedia, dạng bướm mùa khô của loài này chỉ có thể phân biệt qua cấu tạo bộ phận sinh dục đực. Loài này khá phổ biến ở độ cao dưới 700m, trong các khu rừng thứ sinh và phổ biến ở các vùng nông nghiệp, các trảng cỏ, bụi cây.', NULL, 'có khắp nơi ở Việt Nam. Phân bố từ Srilanca và Ấn Độ qua Đông nam châu Á đến Sunderland', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(2263, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesismalsara', 'Mycalesis malsara', 'Moore, [1858]', NULL, 'SPA_02272', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2264, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesismineus', 'Mycalesis mineus mineus', '(Linnaeus, 1758)', '', 'SPA_02273', 'Ở cả con đực và con cái, mặt trên có màu nâu. Cánh trước có một con mắt có vòng màu vàng ở giữa màu trắng ở khoảng cách 2 và đôi khi có một con mắt nhỏ tương tự ở khoảng cách 5. Cánh sau đồng nhất, đôi khi có 2 hoặc 3 con mắt mờ. Đường nhạt ở đầu cuối và đầu cuối. Các cánh phía dưới có một đường đĩa hẹp màu trắng tía bắt chéo nhau. Cánh trước có từ 2 đến 4 mắt, cánh sau thường có 7 mắt, trên cả hai cánh các mắt được viền hai bên bởi những đường ngoằn ngoèo màu trắng tía. Năm mắt sau ở mặt dưới của cánh sau xếp thành một đường thẳng. Vào mùa khô, mắt mắt giảm xuống thành những đốm trắng nhỏ. Rừng rụng lá thường xanh và ẩm, cũng gần nơi ở của con người', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Indiabiodiversity'),
(2265, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesismnasicles', 'Mycalesis mnasicles perna', '(Fruhstorfer,1906)', '', 'SPA_02274', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2266, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesisnicotia', 'Mycalesis nicotia', 'Hewitson, 1850', 'Bướm mắt sáng', 'SPA_02275', 'Hình thức mùa mưa. Mặt trên Vandyke màu nâu. Cánh trước có một rãnh ở giữa rất lớn, có tâm màu trắng, có nhiều vòng và một, hiếm hơn là hai, mắt dưới đỉnh nhỏ hơn tương tự . Cánh sau có một hoặc hai mắt nhỏ tương tự nhau. Cánh trước và cánh sau có các đường nhạt ở phần cuối và phần cuối. Mặt dưới màu nâu nhạt, con cái nhạt hơn nhiều so với con đực; phần gốc của cánh có các sọc ngang màu nâu cho đến một dải màu trắng hình đĩa rõ nét ở phía trong theo chiều ngang; ngoài ra, một loạt các con mắt tương tự như con mắt ở mặt trên, bốn con ở cánh trước, con mắt ở giữa là lớn nhất, bảy con ở cánh sau, con thứ ba từ hình xuyến và con mắt ở đỉnh là lớn nhất; mép cuối của cánh hơi có màu ánh kim, có các đường dưới cánh bên trong và bên ngoài bắt chéo và một đường mảnh màu nâu sẫm ở cuối cánh, các đường bên dưới ít nhiều ngoằn ngoèo và ngoằn ngoèo. Lông mao cả cánh trước và cánh sau đều nhợt nhạt. Râu, đầu, ngực và bụng màu nâu; anten có màu vàng nhạt ở đỉnh. Dấu hiệu giới tính đực loại 2, chùm lông phủ trên vảy chuyên biệt ở mặt trên cánh sau màu đen. Hình thức mùa khô. Tương tự. Khác nhau ở màu nền của mặt dưới có màu vàng nhạt hơn, mắt kính giảm kích thước nhiều hoặc lỗi thời, và mặt trong của hai đường dưới ít nhiều bị che khuất và mờ nhạt. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2267, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesisperseoides', 'Mycalesis perseoides', '(Moore, [1892])', '', 'SPA_02276', 'Dạng này gần giống với M. Mineus ở cả mẫu vật mùa mưa và mùa khô. Như ở dạng đó, vị trí của mắt ở mặt dưới của cánh sau đã phân biệt nó với M. Perseus . Với M. Mineus, nó khác ở điểm giới tính đực ở mặt dưới của cánh trước, dài hơn, rộng hơn và có màu nâu nhạt chứ không phải màu đen.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2268, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesisperseus', 'Mycalesis perseus tabitha', '(Fabricius,1793)', '', 'SPA_02277', 'Bướm cái hơi lớn hơn, nhạt màu hơn và có thể phân biệt bởi không có dải (chùm vảy đặc biệt) ở mặt trên của cánh sau. Đây là loài gặp theo từng nơi ở vùng đất thấp đặc trưng. Chúng thường xuất hiện dưới tán cây bụi và hoạt động tích cực suốt ngày và rất thích sống gần các bụi cây tre, trúc khi phát măng. Cả bướm đực và bướm cái bay rất gần mặt đất. Chúng thường bị hấp dẫn bởi phân động vật, nước ở các ngọn măng tre, trúc tiết ra. Có một số loài tương tự ở Việt Nam, đó là Mycalesis perseoides, Mycalesis mineus, Mycalesis intermedia, dạng bướm mùa khô của loài này chỉ có thể phân biệt qua cấu tạo bộ phận sinh dục đực. Giống Mycalesis  bay thấp, gần các đám cỏ ven đường mòn. Ba loài khá giống nhau là M.mineus, M.perseus và M.perseoides, có thể phân biệt dựa vào các đốm ở mặt dưới cánh nhưng không dễ. Việc định danh chính xác phải dựa vào cấu trúc cơ quan sinh dục của con đực. M.mineus và M.perseoides là những loài phổ biến. Chúng thường xuất hiện dưới tán cây và hoạt động tích cực suốt ngày. Cả bướm đực và bướm cái bay rất gần mặt đất. Chúng thường bị hấp dẫn bời phân động vật. Có một số loài tương tự ở Việt Nam, đó là M.perseoides, M.zonata, M.intermedia, dạng bướm mùa khô của loài này chỉ có thể phân biệt qua cấu tạo bộ phận sinh dục đực. Loài này khá phổ biến ở độ cao dưới 700m, trong các khu rừng thứ sinh và phổ biến ở các vùng nông nghiệp, các trảng cỏ, bụi cây.', NULL, 'có khắp nơi ở Việt Nam Phân bố từ Srilanca và Ấn Độ qua Đông nam châu Á đến Sunderland,', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(2269, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesissangaica', 'Mycalesis sangaica tunicula', '(Fruhstorfer, 1911)', '', 'SPA_02278', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2270, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesissp', 'Mycalesis sp.', NULL, NULL, 'SPA_02279', 'Mặt trên có màu nâu vandyke sẫm đến hơi nhạt. Cánh trước có một con mắt màu đen, có vòng tròn, ở giữa màu trắng ở khoảng không gian 2, và hiếm khi có một con mắt rất nhỏ nhưng tương tự ở khoảng không gian 5. Cánh sau đồng nhất, đôi khi có hai hoặc ba con mắt mờ sau giữa. Cánh trước và cánh sau có những đường nhạt màu ở phần cuối và phần cuối. Mặt dưới: các đường màu nền, đường dưới và đường cuối trên cánh giống như mặt trên, nhưng bị cắt ngang bởi một dải đĩa đệm hẹp màu tím - trắng thông thường. Cánh trước có từ 2 đến 4 cánh, cánh sau thường có 7 mắt, tương tự nhưng rõ ràng hơn các mắt ở mặt trên; trên cả hai cánh, đường ocelli được bao quanh từ trong ra ngoài bởi những đường ngoằn ngoèo màu trắng tía. Trên cánh sau chỉ có ba mắt sau thẳng hàng, phần còn lại cong mạnh ra phía ngoài. Ở con cái, mắt giữa hoặc mắt sau ở mặt trên của cánh trước luôn lớn hơn ở con đực', NULL, 'được tìm thấy ở Nam Á và Đông Nam Á', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Mycalesis_perseus'),
(2271, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesisvisala', 'Mycalesis visala', 'Moore, [1858]', '', 'SPA_02280', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2272, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Mycalesis', NULL, 'GEN_1266', 'mycalesiszonata', 'Mycalesis zonata', 'Matsumura, 1909.', NULL, 'SPA_02281', 'Sải cánh dài 45 - 50 mm, bề mặt cánh màu nâu, có một mắt ở cánh trên và bảy mắt ở cánh dưới. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(2273, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Neope', NULL, 'GEN_1303', 'neopearmandii', 'Neope armandii', '(Oberthür, 1876)', 'Bướm mắt rắn đa hình', 'SPA_02282', 'Đặc điểm nhận dạng:\n\nĐặc điểm giống: Phân biệt với giống Lethe vì ở cánh sau có một đốm mắt ở khoảng 7 nhưng không nằm trong đường vòng cung của các đốm từ 1b đến 6. Con đực có một dải thường là mờ kéo dài từ giữa mép trong tới gân 4. Có lông mao sặc sỡ ở cả hai cánh. Có lông mắt. Là loài có kích thước lớn hơn loài N.pulaha rất nhiều với khá nhiều dạng vào các mùa khác nhau. Dạng mùa ẩm, ở cánh trước, gân không được phủ những vệt vàng nhạt và có hình dáng rất giống với loài N.pulaha. Dạng mùa khô với cánh sau có màu vàng đậm.\n\nSinh học sinh thái:\n\nĐặc điểm chung: Chỉ sống trong rừng rậm.        ', NULL, 'Loài hiếm. Phân bố ở độ cao từ 700 -1.200m trong các khu rừng nguyên sinh. Từ Ấn Độ, Trung Quốc, Bắc Thái Lan, Việt Nam loài này gặp ở VQG Tam Đảo, Mẫu Sơn – Lạng Sơn …', NULL, NULL, 'Rất có giá trị trong phân loại và đa dạng sinh học.', NULL, NULL, NULL, 'vncreatures.'),
(2274, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Neope', NULL, 'GEN_1303', 'neopemuirheadi', 'Neope muirheadi lahittei', '(Janet, 1894)', NULL, 'SPA_02283', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2275, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Neope', NULL, 'GEN_1303', 'neopepulaha', 'Neope pulaha', '(Moore, [1858])', NULL, 'SPA_02284', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2276, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Neorina', NULL, 'GEN_1305', 'neorinapatria', 'Neorina patria', '(Leech, 1891)', NULL, 'SPA_02285', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2277, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Ragadia', NULL, 'GEN_1706', 'ragadiacrisilda', 'Ragadia crisilda', 'Hewitson, [1862]', NULL, 'SPA_02286', 'Giống Ragadia là một giống khác biệt bởi một số đặc điểm. Sâu non của chúng ăn trên cây dương xỉ. Trên cánh trước gân 12 phồng lên ở gốc của nó. Trên cánh sau sự bài trí các gân rất khác thường. Không có gân ở vùng ô cánh và vùng trung tâm va gân 5 bắt nguồn từ gân 7 trước gân 6. Con đực: vùng trung tâm có một dải trước bao phủ bằng những lông màu chì chạy chéo qua và ở con cái dải đó được phản ánh như một đường có nhiều vết nổi (đường phân giới). ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(2278, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Ragadia', NULL, 'GEN_1706', 'ragadiacritias', 'Ragadia critias', 'Riley & Godfrey,1921.', NULL, 'SPA_02287', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2279, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Satyridae', NULL, 'GEN_1778', 'satyridaesp', 'Satyridae sp.', NULL, NULL, 'SPA_02288', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2280, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Ypthima', NULL, 'GEN_2064', 'ypthimabaldus', 'Ypthima baldus baldus', '(Fabricius,1775)', '', 'SPA_02289', 'Giống Yphima bao gồm các loài có kích thước nhỏ nhất so với các giống khác cùng họ bướm Mắt rắn Satyridae được phân biệt bởi màu trắng bao phủ mặt dưới, có các sọc nằm ngang màu nâu, nhỏ và mang theo các vạch ở mép ngoài cánh, vùng giữa sát mép ngoài và giữa cánh. Con đực của các loài ngoại trừ Y.akbar có các vẩy. Gốc gân 11 và 12 cánh trước hội tụ thành một đường phồng ra và gốc của gân trụ cánh phồng ở một vùng nhỏ hơn.\nThấy ở mọi độ cao và ở mọi nơi từ rừng tới đô thị. Là loài phổ biến nhất trong giống Ypthima. Mặt trên màu nâu, có một đốm mắt lớn ở cánh trước, hai đốm mắt lớn ở cánh sau, có thể có một đốm mắt nhỏ ở góc ngoài cánh sau. Mặt dưới có dạng vằn vện với một đốm mắt rất lớn ở cánh trước và sáu đốm mắt nhỏ ở cánh sau, xếp thành ba nhóm. Ở dạng mùa khô, các đốm mắt tiêu giảm, khó nhận diện cấp loài. Yphima singorensis khá giống Yphim baldus, nhưng nhỏ hơn và mặt dưới cánh sáng màu hơn. Sải cánh 32-48mm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2281, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Ypthima', NULL, 'GEN_2064', 'ypthimahuebneri', 'Ypthima huebneri', 'Kirby, 1871', NULL, 'SPA_02290', 'Bướm có kích thước nhỏ, con đực và cái giống nhau, nhưng con đực thường nhỏ hơn con cái. Đây là loài địa phương hơn là loài phân bố rộng và chúng bay gần khu vực đất trông trọt ở dọc lề đường hoặc các khu rừng phục hồi thứ sinh đất thấp. Sâu non ăn những cây thuộc họ Cỏ Poaceae.', NULL, 'Loài này phân bố suốt bán đảo Ấn Độ đến A-sam, Mianma, Malaysia, Singapor, Thái Lan, Lào và toàn lãnh thổ Việt Nam. Tên bướm đặt vì có 4 đốm mắt trên cánh.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.'),
(2282, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Ypthima', NULL, 'GEN_2064', 'ypthimaimitans', 'Ypthima imitans', 'Elwes & Edwards, 1893', NULL, 'SPA_02291', 'Ở mặt trước và mặt sau của cánh trước, trừ đốm mắt lớn ở đầu phụ, không có đốm mắt nhỏ ở ngăn cu1. Có ba điểm mắt phụ ở mặt sau của cánh sau, điểm mắt thứ nhất không lớn hơn điểm mắt thứ hai một cách rõ ràng và phía trước có hai điểm mắt, không thấy rõ dải màu trắng. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(2283, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Ypthima', NULL, 'GEN_2064', 'ypthimaphilomella', 'Ypthima philomella peguanai', '(Evas, 1923)', '', 'SPA_02292', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2284, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Ypthima', NULL, 'GEN_2064', 'ypthimapraenubila', 'Ypthima praenubila', 'Leech, 1891', NULL, 'SPA_02293', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2285, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Ypthima', NULL, 'GEN_2064', 'ypthimasavara', 'Ypthima savara', '(Grosse-Smith, 1887)', '', 'SPA_02294', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
