(2287, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Satyridae', 'Bướm Mắt Rắn', 'FAM_328', 'Ypthima', NULL, 'GEN_2064', 'ypthimatappana', 'Ypthima tappana', 'Mell, 1942', NULL, 'SPA_02296', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2288, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Sphingidae', 'Bướm Đêm', 'FAM_350', 'Acherontia', NULL, 'GEN_0022', 'acherontiastyx', 'Acherontia styx', '(Westwood, 1847)', NULL, 'SPA_02297', 'Loài này tương tự như loài A. atropos ở châu Âu nhưng khác ở chỗ có hai dải trung gian ở mặt dưới của cánh trước, thay vì một và thường không có dải sẫm màu trên bề mặt bụng. Các vết giống như hộp sọ sẫm màu hơn và có một chấm nước mắt màu xanh mờ được bao bọc bởi một dải dưới mép màu đen ở mặt trên của cánh sau. Điểm đĩa đệm phía trước (nhụy) có màu cam; ở A. atropos nó thường có màu trắng', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Acherontia_styx'),
(2289, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Sphingidae', 'Bướm Đêm', 'FAM_350', 'Herse', NULL, 'GEN_0871', 'herseconvolvuli', 'Herse convolvuli', 'Lin', '', 'SPA_02298', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2290, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Sphingidae', 'Bướm Đêm', 'FAM_350', 'Leucophlebia', NULL, 'GEN_1072', 'leucophlebialineata', 'Leucophlebia lineata', 'Westwood', '', 'SPA_02299', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2291, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Uraniidae', 'Bướm Đêm', 'FAM_388', 'Nyctalaemom', NULL, 'GEN_1340', 'nyctalaemompatrolus', 'Nyctalaemom patrolus', 'Hampson', '', 'SPA_02300', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2292, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'LEPIDOPTERA', 'CÁNH VẨY', 'ORD_048', 'Zygaenidae', 'Bướm Đêm', 'FAM_399', 'Cyclosia', NULL, 'GEN_0522', 'cyclosiapapilionaris', 'Cyclosia papilionaris', '(Drury, 1773).', 'Bướm đêm cánh tròn', 'SPA_02301', 'Loài bướm đêm đẹp này bắt trước các một số loài Bướm hổ xanh Ideopsis sp.để lần tránh kẻ thù tự nhiên. Kích thước trung bình, sải cánh: 75 - 85mm. Mặt cánh trên có màu đen làm nền với các đốm và vạch như trắng làm cho bướm có màu sáng trắng. Mép cánh đầu, thân, ngực có màu lam ngọc bích rất nổi khi đậu, bụng có sọc màu lam ngọc bích và trắng, mặt dưới cánh gần giống mặt trên cánh và viền cánh màu đen Loài bướm đêm giả bướm ngày này thường xuất hiện vào sáng sớm. Chúng thưởng thức bữa sáng bằng cách hút mật hoa của một số loài cây Cỏ hôi, Cỏ lào. Ở Việt Nam, nơi sống thường gặp ở độ cao từ 50 đến 1.000m, bao gồm rừng nhiệt đới và rừng rụng lá ẩm ướt. Sâu non thường bị ký sinh bởi một loại giun tròn gây bệnh côn trùng. Loài giun này sống trên lá cây làm thực ăn của sâu non và bị nhiễm trong qua trình di chuyển. Sau khi xâm nhập vào cơ thể của sâu bướm, tuyến trùng, ăn thịt bên trong các mô cơ thể của sâu bướm. Khi tuyến trùng đã trưởng thành hoàn toàn, đào hang để chui ra khỏi sâu bướm, khiến sâu bướm từ từ teo lại và chết. Chu kỳ hoàn thành khi tuyến trùng sẽ rơi xuống đất và sinh sản trong đất. Sau đó, một thế hệ mới của tuyến trùng nhỏ bé sẽ bò lên lá để chờ một con sâu bướm khác đến để ký sinh', NULL, 'Phân bố khắp Việt Nam Thái Lan tới miền nam Trung Quốc và cũng được tìm thấy ở Quần đảo Andaman và Nicobar, Ấn Độ', NULL, NULL, 'Là loài bướm đẹp', NULL, NULL, NULL, 'VN Creature'),
