(2298, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'MANTOIDEA', 'BỌ NGỰA', 'ORD_050', 'Iridopterygidae', NULL, 'FAM_200', 'Hapalopezella', NULL, 'GEN_0818', 'hapalopezellasp2', 'Hapalopezella sp2', NULL, NULL, 'SPA_02307', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2299, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'MANTOIDEA', 'BỌ NGỰA', 'ORD_050', 'Mantidae', 'Bọ Ngựa', 'FAM_229', 'Creobroter', NULL, 'GEN_0484', 'creobroterapicalis', 'Creobroter apicalis', 'Saussure, 1869', 'Bọ ngựa cánh xanh trung bộ', 'SPA_02308', 'Loài bọ ngựa có kích thước nhỏ, cơ thể 3 - 4cm. Con cái lớn hơn con đực. Khác với loài bọ ngựa cánh xanh bắc bộ Creobroter gemmatus cơ thể có màu xanh lá, kể cả phần chân. Mặt cánh trên có màu xanh với hai đốm mắt màu cam có viền đen rất rõ. Lớp cánh bên trong của chúng đa sắc màu gồm phần chót cánh trong có màu xanh nhạt, 1/3 diềm cánh ngoài và gốc cánh có màu tím đậm, phần còn lại có nâu xanh nhạt với các sọc trắng nhạt không đều nằm ngang. Mắt màu xanh lá, hình tháp. Cặp chân trước lớn và có răng cưa, ở đỉnh có móc sắc nhọn để bắt, giữ con mồi như loài bọ ngựa khác Loài côn trùng biến thái không hoàn toàn sống trong các khu vực trảng cỏ cao hoặc ven suối. Thức ăn của chúng là các loài côn trùng trong khu vực sinh sống như ruồi, bướm. Loài này thường xuất hiện vào đầu mùa mưa khi tháng 9 ở VQG Núi Chúa, Ninh Thuận. Đã gặp giao phối và đẻ trứng tháng 10 hàng năm ở VQG Cát Tiên, Đồng Nai. Con cái có tập tính ăn thịt con đực sau khi giao phối', NULL, ' ', NULL, NULL, 'Loài hiếm và rất thú vị để cho học sinh, sinh viên tìm hiểu về tập tính ngụy trang săn mồi của loài côn trùng này', NULL, NULL, NULL, 'VN Creature'),
(2300, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'MANTOIDEA', 'BỌ NGỰA', 'ORD_050', 'Mantidae', 'Bọ Ngựa', 'FAM_229', 'Creobroter', NULL, 'GEN_0484', 'creobrotergemmatus', 'Creobroter gemmatus', 'Saussure, 1869', 'Bọ ngựa cánh xanh bắc bộ', 'SPA_02309', 'Loài bọ ngựa có kích thước trung bình, cơ thể 4 - 5cm. Con cái lớn hơn con đực, cơ thế màu trắng nhạt, phần lưng, cánh có màu xanh lá và mâu nhạt. Mặt cánh trên có màu nâu với hai đốm mắt màu vàng có viền đen rất rõ. Lớp cánh bên trong của chúng nhìn giống như 1 tác phẩm nghệ thuật của tạo hóa và là một trong những kiệt tác của thiên nhiên. Phần chót cánh trong có màu bạc, 1/3 diềm cánh ngoài và gốc cánh có màu tím đậm, phần còn lại có màu xanh đậm với các sọc trắng nhạt nằm ngang. Mắt màu xanh nhạt, hình tháp. Cặp chân trước lớn và có răng cưa, ở đỉnh có móc sắc nhọn để bắt, giữ con mồi như loài bọ ngựa khác trong bộ Bọ ngựa Loài côn trùng biến thái không hoàn toàn sống trong các khu vực trảng cỏ cao hoặc ven suối. Thức ăn của chúng là các loài côn trùng trong khu vực sinh sống như ruồi, bướm ... Loài này thường xuất hiện vào đầu mùa mưa khi. Đã gặp giao phối và đẻ trứng tháng 4 hàng năm', NULL, 'Bắc Bộ ', NULL, NULL, 'Loài hiếm và rất thú vị để cho học sinh, sinh viên tìm hiểu về tập tính ngụy trang săn mồi của loài côn trùng này', NULL, NULL, NULL, 'VN Creature'),
(2301, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'MANTOIDEA', 'BỌ NGỰA', 'ORD_050', 'Mantidae', 'Bọ Ngựa', 'FAM_229', 'Creobroter', NULL, 'GEN_0484', 'creobrotersp1', 'Creobroter sp1', NULL, NULL, 'SPA_02310', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2302, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'MANTOIDEA', 'BỌ NGỰA', 'ORD_050', 'Mantidae', 'Bọ Ngựa', 'FAM_229', 'Hierodula', NULL, 'GEN_0883', 'hierodulapatellifera', 'Hierodula patellifera', '(Serville)', '', 'SPA_02311', 'Con đực dài khoảng 45–65 mm và con cái dài khoảng 65–75 mm. [2] Các cá thể có thể có màu sắc khác nhau từ xanh đến nâu. Mặc dù loài này có kích thước khá lớn đối với bọ ngựa nói chung nhưng nó lại là một trong những thành viên nhỏ nhất của chi Hierodula , trong đó nhiều loài có thể đạt tới 110–150 mm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
