(2305, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'MANTOIDEA', 'BỌ NGỰA', 'ORD_050', 'Mantidae', 'Bọ Ngựa', 'FAM_229', 'Hierodula', NULL, 'GEN_0883', 'hierodulasp3', 'Hierodula sp3', NULL, NULL, 'SPA_02314', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2306, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'MANTOIDEA', 'BỌ NGỰA', 'ORD_050', 'Mantidae', 'Bọ Ngựa', 'FAM_229', 'Hierodula', NULL, 'GEN_0883', 'hierodulasp4', 'Hierodula sp4', NULL, NULL, 'SPA_02315', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2307, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'MANTOIDEA', 'BỌ NGỰA', 'ORD_050', 'Mantidae', 'Bọ Ngựa', 'FAM_229', 'Mantis', NULL, 'GEN_1160', 'mantisreligiosa', 'Mantis religiosa', 'Lin.', 'Bọ ngựa', 'SPA_02316', 'Là loài côn trùng cỡ lớn, dài 40 - 80 mm, có hai cánh trước và hai cánh sau phát triển rộng. Hai cánh sau trông như tấm kính và chỉ ở viền trước trên đầu mút, cánh có màu xanh lá cây nhạt hoặc nâu nhạt, Đốt ngực trước dạng ống kéo dài và ở phía trong các x­ơng chậu của đôi chân trước có 1 chấm đen, thường với một điểm nâu sáng ở chính giữa. Đôi chân trước có dạng l­ưỡi kiếm, bờ trong có răng, dùng để bắt mồi và chiến đấu với kẻ thù. Con cái thường lớn hơn con đực (Cái 48 - 76 mm; đực 40 - 61 mm). Màu sắc thay  đổi theo màu của nơi ở (nhất là khi rình mồi): màu thường xuất hiện xanh lá cây, màu cỏ úa hoặc vàng, nâu Thức ăn là các loại côn trùng khác nhau phụ thuộc loài này xuất hiện gần khi chúng rình mồi, nhưng đối với ấu trùng thì có chọn lọc và có thức ăn nhất định đó là rệp cây. Thậm chí Bọ ngựa còn ăn thịt lẫn nhau, đặc biệt là con cái có thể ăn thịt con đực ngay trong thời gian giao phối hoặc sau khi đó. Thời gian đẻ trứng từ đầu hè tới cuối thu. Con cái đẻ trứng sau khi giao phối ít lâu. Một lần đẻ khoảng 100 - 300 trứng sắp đều đặn trong tổ trứng. Trứng bọ ngựa được đẻ vào mùa hè hoặc đầu mùa thu thì nở ngay ra con sau một thời ngan ngắn (trên dưới 1 tháng). Trứng bọ ngựa được đẻ vào cuối mùa thu thường sống qua đông đến mùa xuân mới nở và ấu trùng lớn rất nhanh và sau 4 lần lột xác phát triển tới dạng trưởng thành. Màu sắc cơ thể thường mang tích chất bảo vệ ngụy trang phù hợp với màu sắc của cây và nơi sống, loài này có 3 màu cơ bản như đã mô tả ở trên. Thường gặp chúng trên các cây to, cây bụi hơn là trên cây thân cỏ', NULL, 'Khắp trên lãnh thổ Việt Nam Là loài phân bố rộng ở cả vùng ôn đới và nhiệt đới thuộc các châu lục: châu Âu, châu Á, châu Phi, thậm chí cả ở Bắc Mỹ và Australia', NULL, NULL, 'Đây là loài côn trùng có lợi nhiều hơn có hại vì chúng tiêu diệt nhiều côn trùng có hại, đặc biệt chúng còn ăn rất nhiều các loài rệp hại cây (Aphididae). Chúng còn làm đẹp cho thiên nhiên. Tuy nhiên đôi khi chúng còn ăn cả ong mật và các loại côn trùng có lợi khác', ' Bậc V', NULL, NULL, 'VN Creature'),
