(2332, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Amphipterygidae', 'Chuồn Chuồn', 'FAM_016', 'Sinolestes', NULL, 'GEN_1824', 'sinolesteseditus', 'Sinolestes editus', 'Needham, 1930', 'Chuồn chuồn hoàng kim', 'SPA_02341', 'Loài chuồn  chuồn  có  kích  thước  lớn, dài khoảng 6cm, toàn thân có màu vàng và màu xanh  lá  ánh kim  đặc trưng rất đẹp. Chúng bay chậm, khi đậu thường treo mình trên những cành cây khô với đôi cánh mở. Cánh của con đực có nhiều hình dạng khác nhau: hoặc trong suốt, hoặc có một vệt đen lớn ở giữa, hoặc đôi khi chỉ là một vệt đen nhỏ ở gần mép ngoài cánh Loài này thường sinh sống gần các con suối nhỏ nước sạch, tốc độ dòng chảy nhẹ và nền đáy có nhiều thảm mục, hai bên bờ có nhiều cây bụi rậm rạp che phủ không gian phía trên mặt nước. Loài chủ yếu tìm thấy ở những khu rừng ít bị tác động bởi con người', NULL, 'Bắc Bộ, mới phát hiện vùng phân bố mới ở  VQG Konkakinh, Gia Lai  Loài phân bố rộng ở phía nam Trung Quốc và phía bắc Việt Nam', NULL, NULL, 'Có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
