(2334, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Calopterygidae', 'Chuồn Chuồn Kim Cánh Rộng', 'FAM_057', 'Caliphaea', NULL, 'GEN_0280', 'caliphaeathailandica', 'Caliphaea thailandica', 'Asahina, 1976', NULL, 'SPA_02343', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2335, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Calopterygidae', 'Chuồn Chuồn Kim Cánh Rộng', 'FAM_057', 'Cryptophaea', NULL, 'GEN_0494', 'cryptophaeavietnamensis', 'Cryptophaea vietnamensis', '(J.V.Tol & Rozendaal, 1995)', NULL, 'SPA_02344', 'Con non mới lột xác và con hoàn toàn trưởng thành có màu sắc cơ thể khác nhau. Ở Con đực còn non, ngực màu đen với một sọc lớn màu xanh và vàng nhạt hình chữ U đặc trưng, cùng hai sọc nhỏ hơn ở hai dưới; và trở nên hoàn toàn màu xanh dương ở con trưởng thành; chân ở con non có màu xanh dương, và hoàn toàn màu đen ở con trưởng thành. Cánh trong suốt, điểm cánh (pterostigma) màu đen. Bụng dài và mảnh, có màu xanh đen. Con cái: Con non và con trưởng thành có màu hoàn toàn khác nhau. Ngực của con non có các sọc lớn màu xanh dương ở hai bên, và một sọc mảnh kéo dài dọc theo các đốt bụng; trong khi ở con cái trưởng thành thì các sọc này lại có màu đỏ gạch. Cánh trong suốt, điểm cánh màu đen. Kích thước: Cánh sau 29-31 mm; bụng (và phần phụ sinh dục) dài 44-46 mm Loài này thường gặp vào các tháng 5-7 hàng năm. Chúng sinh sống gần con suối sạch ở trong các khu rừng ít bị tác động; tốc độ dòng chảy chậm, hai bên bờ có nhiều cây bao phủ; nền đáy có nhiều mùn bã thực vật', NULL, 'Bắc Bộ Trung Quốc, Lào', NULL, NULL, 'Có giá trị nghiên cứu khoa học', NULL, NULL, NULL, 'VN Creature'),
