(2358, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Coenagrionidae', 'Chuồn Chuồn Kim', 'FAM_096', 'Agriocnemis', NULL, 'GEN_0049', 'agriocnemispygmaea', 'Agriocnemis pygmaea', '(Rambur, 1842)', '', 'SPA_02367', 'Đó là một loài chuồn chuồn nhỏ với đôi mắt màu xanh lá cây có nắp màu đen, ngực màu đen với sọc xanh táo ở hai bên. Các đốt từ 1 đến 7 của bụng có màu đen ở lưng và màu xanh nhạt ở nửa bụng. Các đoạn còn lại có màu đỏ cam. Những con đực rất già có thể bị cắt bớt những mảng trắng như tuyết trên lưng đầu và ngực, khiến tất cả các dấu vết bên dưới bị che khuất hoàn toàn. Con cái khỏe mạnh hơn và có nhiều hình thái màu sắc . Màu xanh lá cây của con đực được thay thế bằng màu đỏ ở con cái ở dạng màu đỏ. Ở dạng androchrome , con cái có màu xanh lục giống như ở con đực. [7] Sự biến đổi màu sắc của con cái cũng phụ thuộc vào sự thay đổi màu sắc sinh sản liên quan đến sự phát triển giới tính.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
