(2374, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Coenagrionidae', 'Chuồn Chuồn Kim', 'FAM_096', 'Mortonagrion', NULL, 'GEN_1254', 'mortonagrionaborense', 'Mortonagrion aborense', '(Laidlaw, 1914)', '', 'SPA_02383', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2375, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Coenagrionidae', 'Chuồn Chuồn Kim', 'FAM_096', 'Paracercion', NULL, 'GEN_1444', 'paracercioncalamorum', 'Paracercion calamorum', '(Ris, 1916)', '', 'SPA_02384', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2376, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Coenagrionidae', 'Chuồn Chuồn Kim', 'FAM_096', 'Paracercion', NULL, 'GEN_1444', 'paracercionmelanotum', 'Paracercion melanotum', '(Selys, 1876)', '', 'SPA_02385', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2377, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Coenagrionidae', 'Chuồn Chuồn Kim', 'FAM_096', 'Pseudagrion', NULL, 'GEN_1643', 'pseudagrionaustralasiae', 'Pseudagrion australasiae', 'Selys, 1876', '', 'SPA_02386', 'có kích thước trung bình với đôi mắt xanh, phía trên có màu sẫm. Phía sau đầu có màu xanh nhạt, viền đen. Ngực của nó có màu xanh lam với các sọc lưng và sọc đen rộng trên lưng. Đốt bụng 1 và 2 có màu xanh lam với các vết đen ở lưng. Dấu ở đoạn 2 trông giống như một chiếc bình, mở rộng rộng rãi ở giữa. Các đốt từ 3 đến 7 có màu đen ở lưng và màu xanh ở hai bên. Có các vòng đỉnh hẹp màu xanh trên mỗi đoạn. Đoạn 8 và 9 có màu xanh lam với viền đỉnh hẹp màu đen. Đốt 10 có một vết đen rộng hình chữ X ở mặt lưng và có màu xanh ở hai bên. Phần phụ trên của hậu môn có màu đen, phân nhánh ra ngoài và cong vào trong ở đỉnh như hình móc câu. Chúng chia đôi ở đỉnh và có chiều dài bằng một nửa đốt 10. Đoạn dưới dài bằng đốt trên. Mắt và ngực của con cái có màu xanh lục nhạt, giống con đực. Màu sắc của bụng tương tự như con đực, nhưng nhạt hơn. Đoạn 8 và 9 cũng có màu đen với các vòng màu xanh ở đỉnh. Đoạn 10 có màu xanh nhạt Nó sinh sản ở ao, hồ, ruộng lúa và đầm lầy.', NULL, ' Nó được tìm thấy ở Ấn Độ , Trung Quốc , Indonesia , Malaysia , Myanma , Singapore và Thái Lan ', NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
(2378, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Coenagrionidae', 'Chuồn Chuồn Kim', 'FAM_096', 'Pseudagrion', NULL, 'GEN_1643', 'pseudagrionpruinosum', 'Pseudagrion pruinosum', '(Burmeister, 1839)', '', 'SPA_02387', 'có mắt kép, mặt trên màu đen còn mặt dưới màu đỏ cam. Bụng có màu nâu đen và trở thành kim loại khi tiếp xúc với ánh sáng mặt trời. Cơ thể có hoa văn màu bạc, đôi cánh trong suốt màu sẫm và bàn chân màu đen.  dễ thích nghi với sự xáo trộn môi trường sống và có thể tồn tại ở các dòng suối trong khu vực rừng trồng. Thức ăn: Động vật ăn thịt, động vật ăn côn trùng. giao phối ở tư thế song song. Con cái đẻ trứng lên mô thực vật bằng kỹ thuật định vị cơ thể ở trên bề mặt rồi chìm xuống . Con đực bảo vệ con cái khi chúng đẻ trứng. \n\n', NULL, ' Campuchia, Trung Quốc, Hồng Kông, Ấn Độ, Indonesia, Malaysia, Myanmar, Singapore, Thái Lan, Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'baliwildlife'),
(2379, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Coenagrionidae', 'Chuồn Chuồn Kim', 'FAM_096', 'Pseudagrion', NULL, 'GEN_1643', 'pseudagrionrubriceps', 'Pseudagrion rubriceps', 'Selys, 1876', '', 'SPA_02388', 'có kích thước trung bình với đôi mắt màu cam sáng, bên dưới màu xanh lục. Con đực có thể dễ dàng được phân biệt với tất cả các loài Pseudagrion khác bởi khuôn mặt màu đỏ cam rực rỡ. Ngực của nó có màu xanh ô liu ở phía trên và màu xanh lam ở hai bên. Có một carina hẹp ở giữa lưng và các sọc đen ở cánh tay. Bụng có màu xanh ở hai bên, có nhiều đốm đen ở lưng, đến đốt 8. Đốt 9 và 10 có màu xanh lam không có dấu vết. Phần phụ hậu môn có màu đen. Mắt, mặt và ngực của con cái có màu xanh vàng, giống con đực. Màu sắc của bụng giống con đực; nhưng nhạt hơn. Đoạn 8 và 9 cũng có màu đen với các vòng màu xanh ở đỉnh. Đoạn 10 có màu xanh nhạt. Phân bố rộng khắp vùng đồng bằng và vùng núi thấp. Nó sinh sản ở những dòng suối và ao có cỏ dại.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
(2380, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Coenagrionidae', 'Chuồn Chuồn Kim', 'FAM_096', 'Pseudagrion', NULL, 'GEN_1643', 'pseudagrionwilliamsoni', 'Pseudagrion williamsoni', 'Fraser, 1922', '', 'SPA_02389', ' Nó có vết màu ô liu nhạt trên đầu và lưng của cơ tổng hợp. Cánh sau của nó có thể dài tới 16,5 mm, có thân hình mảnh mai hơn.   Nó thường được tìm thấy ở nhiều loại đất ngập nước, bao gồm các dòng suối chảy chậm và nước đọng, trong hoặc gần rừng ', NULL, ' bán đảo Malaysia, Borneo, Thái Lan và Miến Điện', NULL, NULL, NULL, NULL, NULL, NULL, 'Mybis'),
(2381, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Devadattidae', NULL, 'FAM_120', 'Devadatta', NULL, 'GEN_0572', 'devadattacyanocephala', 'Devadatta cyanocephala', 'Hämäläinen', NULL, 'SPA_02390', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2382, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Euphaeidae', 'Chuồn Chuồn Cánh Trơn', 'FAM_144', 'Dysphaea', NULL, 'GEN_0622', 'dysphaeagloriosa', 'Dysphaea gloriosa', 'Fraser, 1938', '', 'SPA_02391', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2383, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Euphaeidae', 'Chuồn Chuồn Cánh Trơn', 'FAM_144', 'Euphaea', NULL, 'GEN_0690', 'euphaeaguerini', 'Euphaea guerini', 'Rambur, 1842', NULL, 'SPA_02392', 'Con đực Euphaea guerini có thân màu đen và đôi cánh sẫm màu. FW có hyaline cả về cơ bản và đỉnh. CT rất tối với màu xanh kim loại ở mặt dưới bao phủ khoảng 2/3 cánh và có đốm màu xanh lục ở vùng đáy hậu môn ở mặt trên. S9 đực có một chùm lông. Ở con cái, cánh có màu trong suốt với phần gốc màu vàng cam và đầu, ngực và bụng có màu hơi vàng. Loài này chưa được ghi nhận ở Thái Lan ( Hämäläinen 2017) và Campuchia ( Kosterin 2014, 2016), mặc dù Martin (1904) và sau đó là Asahina (1985) đã đề cập đến Campuchia là địa phương của loài này mà không đưa ra địa điểm cụ thể. Yokoi & Kano (2002) và Yokoi & Souphanthong (2005) đã báo cáo bệnh này ở miền Trung và miền Nam Lào. Tuy nhiên, ở Campuchia, miền Trung Nam Lào và miền Trung Việt Nam', NULL, 'Việt Nam (Thái Nguyên, Phú Thọ, Vĩnh Phúc, Hòa Bình, Nghệ An, Hà Tĩnh, Quảng Bình, Quảng Trị, Thừa Thiên-Huế, Quảng Nam, Quảng Ngãi, Lâm Đồng và Khánh Hòa), Trung Quốc (Tỉnh Quảng Tây) ( Wilson & Reels 2003), Lào (tỉnh Bolikhamxay và Attapeu) ( Yokoi & Kano 2002, Yokoi & Souphanthong 2005).', NULL, NULL, NULL, NULL, NULL, NULL, 'https://tb.plazi.org/GgServer/html/006F87D3FFFEEC04B594F944FF5FD6B9'),
