(2402, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Lestidae', NULL, 'FAM_216', 'Indolestes', NULL, 'GEN_0959', 'indolestesgracilis', 'Indolestes gracilis', '(Hagen in Selys, 1862)', NULL, 'SPA_02411', 'Đó là một con chuồn chuồn có kích thước trung bình với đôi mắt xanh. Ngực của nó có màu đen ở phần lưng với một sọc hẹp màu xanh lam ở giữa lưng và rộng ở phần trước. Mép dưới màu đen giống như răng cưa, tiếp theo là màu xanh lam ở gốc các cạnh bên. Cánh trong suốt với các đốm pterostigma màu đen hoặc nâu đỏ sẫm . Bụng có màu xanh lam ở hai bên, màu đen rộng ở mặt lưng cho đến nửa đáy của đốt 9. Nửa đỉnh của đốt 9 và toàn bộ đốt đốt 10 có màu xanh lam. Có một đốm đen ở mỗi bên đốt 10. Phần phụ hậu môn có màu xanh; màu đen trên con đực già', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Indolestes_gracilis'),
