(2447, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Neurothemis', NULL, 'GEN_1319', 'neurothemisfluctuans', 'Neurothemis fluctuans', '(Fabricius, 1773)', '', 'SPA_02458', 'Con đực có ngực và bụng màu nâu đỏ. Các cánh gần như hoàn toàn có màu đỏ nâu ngoại trừ phần đầu và một dải mỏng trong suốt thuôn nhọn xung quanh mép sau tính từ điểm giữa của nó. Con cái có màu xỉn hơn và có đôi cánh rõ ràng. Những con đực vị thành niên trông giống con cái ngoại trừ các dấu hiệu ở cánh. ', NULL, ' Phổ biến rộng rãi ở vùng nhiệt đới châu Á.', NULL, NULL, NULL, NULL, NULL, NULL, 'National Parks Board'),
(2448, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Neurothemis', NULL, 'GEN_1319', 'neurothemisfulvia', 'Neurothemis fulvia', '(Drury, 1773)', NULL, 'SPA_02459', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2449, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Neurothemis', NULL, 'GEN_1319', 'neurothemisintermedia', 'Neurothemis intermedia', 'Rambur, 1842', '', 'SPA_02460', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2450, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Neurothemis', NULL, 'GEN_1319', 'neurothemissp1', 'Neurothemis sp1', NULL, NULL, 'SPA_02461', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2451, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Neurothemis', NULL, 'GEN_1319', 'neurothemistullia', 'Neurothemis tullia', '(Drury, 1773)', '', 'SPA_02462', 'Ở con đực trưởng thành, đặc điểm dễ nhận thấy nhất là đôi cánh của nó. Cả cánh trước và cánh sau đều có màu đen từ gốc cánh đến khoảng một nửa. Ngoài ra còn có một mảng màu trắng theo sau màu đen. Điều này chỉ có ở những con đực trưởng thành. Những con đực nhỏ nhất chưa có vết trắng. Có một đường lưng màu kem với viền đen chạy từ phần trước ngực đến chữ S-8 trên bụng, đường này biến mất khi trưởng thành. Đôi mắt có màu đỏ anh đào ở mặt lưng và màu xanh lá cây ở gốc.  ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Thaiodonata'),
(2452, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Nychogomphus', NULL, 'GEN_1339', 'nychogomphusduaricus', 'Nychogomphus duaricus', NULL, '', 'SPA_02463', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2453, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Onychothemis', NULL, 'GEN_1377', 'onychothemistestacea', 'Onychothemis testacea', 'Laidlaw, 1902', '', 'SPA_02464', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2454, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Orientogomphus', NULL, 'GEN_1397', 'orientogomphusnanninus', 'Orientogomphus nanninus', NULL, '', 'SPA_02465', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2455, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Orthetrum', NULL, 'GEN_1402', 'orthetrumchrysis', 'Orthetrum chrysis', '(Selys, 1891)', '', 'SPA_02466', 'Con đực có khuôn mặt đỏ và đôi mắt màu xám đen. Ngực màu nâu sẫm và bụng màu đỏ. Con cái có màu nâu đỏ. Rừng, Nước ngọt, Công viên & Vườn', NULL, ' Phổ biến rộng rãi ở vùng nhiệt đới châu Á.', NULL, NULL, NULL, NULL, NULL, NULL, 'National Parks Board'),
(2456, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Orthetrum', NULL, 'GEN_1402', 'orthetrumglaucum', 'Orthetrum glaucum', '(Brauer, 1865)', '', 'SPA_02467', 'Con đực có mắt màu xanh lục, ngực màu xanh đậm và bụng màu xanh nhạt với hai đốt cuối sẫm màu. Một mảng nhỏ được tìm thấy ở gốc cánh sau. Con cái có màu nâu nhạt với đôi mắt màu xanh xám. Nhìn thấy gần các khu rừng trong và xung quanh khu bảo tồn thiên nhiên.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'National Parks Board'),
(2457, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Orthetrum', NULL, 'GEN_1402', 'orthetrumluzonicum', 'Orthetrum luzonicum', '(Brauer, 1868)', '', 'SPA_02468', 'Con đực trưởng thành có màu xanh nhạt hoàn toàn. Nó có một cái bụng thon dài. Đế cánh HIndwing chỉ có tông màu vàng nhẹ và hẹp. Đôi mắt có màu xanh nhạt. Con chuồn chuồn này có thể được tìm thấy ở đầm lầy và ao hồ. Nó có sở thích về dòng chảy.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'National Parks Board'),
(2458, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Orthetrum', NULL, 'GEN_1402', 'orthetrumpruinosum', 'Orthetrum pruinosum', '(Burmeister, 1839)', NULL, 'SPA_02469', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2459, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Orthetrum', NULL, 'GEN_1402', 'orthetrumsabina', 'Orthetrum sabina', '(Drury, 1770)', NULL, 'SPA_02470', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2460, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Orthetrum', NULL, 'GEN_1402', 'orthetrumsp1', 'Orthetrum sp1', NULL, NULL, 'SPA_02471', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2461, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Orthetrum', NULL, 'GEN_1402', 'orthetrumtriangulare', 'Orthetrum triangulare', '(Selys, 1878)', '', 'SPA_02472', 'Đó là một con chuồn chuồn cỡ trung bình với khuôn mặt sẫm màu và đôi mắt xanh. Ngực của nó cũng có màu đen với một sọc rộng màu xanh táo ở hai bên. Các đốt 1-2 và 8-10 ở bụng có màu đen và các đốt còn lại được cắt tỉa màu xanh lam  Nó thường được tìm thấy ở các đầm lầy gắn liền với suối trên đồi nơi nó sinh sản', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
(2462, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Pantala', NULL, 'GEN_1433', 'pantalaflavescens', 'Pantala flavescens', '(Fabricius, 1798)', NULL, 'SPA_02473', 'Chuồn chuồn dài tới 4,5 cm,  đạt sải cánh dài từ 7,2 cm đến 8,4 cm.  Mặt trước của đầu có màu hơi vàng đến hơi đỏ. Ngực thường có màu vàng đến vàng với một đường sẫm màu và có lông . Cũng có những mẫu vật có ngực màu nâu hoặc ô liu. Bụng có màu tương tự như ngực .', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
(2463, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Paragomphus', NULL, 'GEN_1448', 'paragomphuscapricornis', 'Paragomphus capricornis', '(Tawny hooktail).', '', 'SPA_02474', ' Cánh sau của nó có thể dài tới 24 mm. Nó có thân hình nhỏ nhắn và khỏe mạnh với các dải màu vàng và đen. Con đực có phần phụ ở hậu môn phía trên giống thanh mã tấu rất dài so với con cái nhưng cả hai giới đều có dấu vết giống hệt nhau  Nó có thể được tìm thấy dọc theo những con suối trong vắt có đáy rải sỏi hoặc sỏi ở vùng đất trống hoặc rừng thưa ', NULL, ' Loài chuồn chuồn này phổ biến rộng rãi ở Bán đảo Malaysia; trải dài về phía bắc từ Miến Điện đến đông nam Trung Quốc', NULL, NULL, NULL, NULL, NULL, NULL, 'Mybis'),
(2464, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Phyllothemis', NULL, 'GEN_1548', 'phyllothemiseltoni', 'Phyllothemis eltoni', 'Fraser, 1935.', '', 'SPA_02475', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2465, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Potamarcha', NULL, 'GEN_1617', 'potamarchacongener', 'Potamarcha congener', 'Rambur, 1842 ', '', 'SPA_02476', 'là một loài chuồn chuồn cỡ trung bình có ngực màu đen hơi xanh và đuôi màu vàng có các vết đen. Mặt có màu vàng ô liu đến đen thép hoặc nâu. Đôi mắt có màu nâu đỏ ở trên và màu xám xanh ở dưới. Ở con đực trưởng thành, ngực và bốn đoạn đầu của bụng được bao phủ bởi lớp lông màu xanh nhạt . Ở con non, các vết màu vàng có thể nhìn thấy qua giai đoạn trưởng thành. Phần còn lại của bụng có màu đen với các vết màu cam, với hai đoạn cuối hoàn toàn màu đen. Ngực cái có sọc vàng và đen ở hai bên. Bụng có màu đen với những mảng màu cam xỉn và có các vạt nổi bật ở mỗi bên của đốt tám. Các nắp có thể dùng để giữ trứng cố định trong quá trình rụng trứng Con chuồn chuồn này được tìm thấy ở những vùng đất có nước đọng . Điều này có thể bao gồm các ao nhỏ, ruộng lúa hoặc đầm lầy nơi nó sinh sản', NULL, '  trải dài qua các khu vực ở Nam Á, Đông Nam Á và Châu Đại Dương, bao gồm cả các quốc gia như Ấn Độ, Indonesia, Trung Quốc, Úc và Việt Nam. ', NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
(2466, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Rhodothemis', NULL, 'GEN_1737', 'rhodothemisrufa', 'Rhodothemis rufa', '(Rambur, 1842)', '', 'SPA_02477', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2467, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Rhyothemis', NULL, 'GEN_1749', 'rhyothemisphyllis', 'Rhyothemis phyllis', 'Sulzer, 1776', '', 'SPA_02478', 'Đôi mắt có màu nâu đỏ ở phía trên và phía dưới màu nâu nhạt. Đầu, ngực và bụng có màu nâu sẫm, hơi kim loại gần như đen. Cánh dài hơn cơ thể. Đôi cánh trong suốt với màu đen ở đầu. Phần gốc của cánh sau có hoa văn đặc biệt màu vàng, nâu sẫm và xanh kim loại đậm. có thể được tìm thấy ở ao, đầm lầy và rừng đầm lầy. giao phối ở vùng nước như ao, đầm lầy, hồ và nước chảy. Con cái đẻ trứng, nó sẽ đẻ trứng trên mặt nước. ăn côn trùng nhỏ khác.', NULL, ' Ấn Độ, Trung Quốc, Malaysia, Indonesia, Campuchia, Thái Lan, Singapore, Đài Loan, Việt Nam và Bắc Úc.', NULL, NULL, NULL, NULL, NULL, NULL, 'baliwildlife.'),
(2468, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Rhyothemis', NULL, 'GEN_1749', 'rhyothemisplutonia', 'Rhyothemis plutonia', 'Selys, 1883', '', 'SPA_02479', ' Cánh sau của nó có thể dài tới 32 mm. Nó có thể dễ dàng được nhận ra bởi đôi cánh rất rộng và sẫm màu với ánh kim màu xanh tím đậm. Con cái tương tự như con đực. Nó thích đậu ở những nơi đầy nắng với đôi cánh lõm hoặc góc cạnh để tránh ánh nắng mặt trời. Loài chuồn chuồn này rất hiếm và có thể được tìm thấy gần các kênh di chuyển chậm trong các khu rừng đầm lầy vùng đất thấp', NULL, ' bán đảo Malaysia, Sumatra và lục địa nhiệt đới châu Á ', NULL, NULL, NULL, NULL, NULL, NULL, 'mybis'),
(2469, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Rhyothemis', NULL, 'GEN_1749', 'rhyothemissp1', 'Rhyothemis sp1', NULL, NULL, 'SPA_02480', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
