(2472, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Libellulidae', 'Chuồn Chuồn Ngô', 'FAM_217', 'Tetrathemis', NULL, 'GEN_1941', 'tetrathemisirregularis', 'Tetrathemis irregularis hyalnia', 'Brauer, 1868', '', 'SPA_02483', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
