(2508, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Platycnemididae', 'Chuồn Chuồn Chân Trắng', 'FAM_292', 'Onychargia', NULL, 'GEN_1374', 'onychargiaatrocyana', 'Onychargia atrocyana', '(Selys, 1865)', '', 'SPA_02519', 'Nó là loài chuồn chuồn kim có kích thước trung bình với đầu, ngực đen như nhung và đôi mắt nâu có mũ đen. Phần lưng của ngực có các sọc hẹp phía trước màu vàng chanh ở giai đoạn chưa trưởng thành và giai đoạn mười. Các mặt có màu vàng chanh, được đánh dấu bằng một sọc đen xiên rộng trên đường khâu sau-bên trong giai đoạn đó. Nhưng tất cả những dấu hiệu này đều bị che khuất bởi sự chín muồi ở người trưởng thành. Bụng màu đen, không có dấu vết ở con trưởng thành; nhưng có các vòng cơ bản hẹp màu xanh lam ở các đốt 3 đến 6. Có các vết màu vàng ở hai bên của đốt 1 và 2 ở cá con chưa trưởng thành. Con cái tương tự như con đực chưa trưởng thành với các vết màu vàng. Nó sinh sản trong ao và đầm lầy trong rừng', NULL, ' Nó được tìm thấy ở Châu Á : Bangladesh, Trung Quốc, Hồng Kông, Indonesia, Ấn Độ , SriLanka , Myanmar , Malaysia , Philippines , Bán đảo Malaysia , Singapore , Thái Lan ,Việt Nam ', NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
