(2516, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Platycnemididae', 'Chuồn Chuồn Chân Trắng', 'FAM_292', 'Prodasineura', NULL, 'GEN_1631', 'prodasineuracoerulescens', 'Prodasineura coerulescens', '(Fraser, 1932)', '', 'SPA_02527', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2517, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ODONATA', 'CHUỒN CHUỒN', 'ORD_055', 'Platycnemididae', 'Chuồn Chuồn Chân Trắng', 'FAM_292', 'Prodasineura', NULL, 'GEN_1631', 'prodasineuracroconota', 'Prodasineura croconota', 'Ris, 1916', NULL, 'SPA_02528', 'Đây là những con chuồn chuồn có thân hình tinh tế, với cái đầu rất rộng. Những con đực có màu sắc tương phản rõ rệt, điển hình là thân màu đen có sọc xanh, đỏ hoặc vàng. [2] Màu sắc trên cơ thể con đực (nơi mang cánh) và chóp bụng của con đực, kết hợp với hình dạng của bốn phần phụ cuối (cerci và paraprocts, hoặc con đực dùng để giao hợp) là những đặc điểm hữu ích khi phân biệt các loài. trong chi. Cerci thường giống hình búa với đỉnh nhọn, trong khi các paraprocts rộng thuôn nhọn đột ngột về phía đầu tròn. [2] Trong khi con cái nhìn chung giống với con đực, các chi tiết ở phần trước ngực phát triển tốt của chúng tạo điều kiện thuận lợi cho việc phân loại loài.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Prodasineura'),
