(2566, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ORTHOPTERA', 'CÁNH THẲNG', 'ORD_057', 'Acrididae', 'Châu Chấu', 'FAM_003', 'Gesonula', NULL, 'GEN_0759', 'gesonulamundata', 'Gesonula mundata', '(Walker, 1870)', NULL, 'SPA_02577', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2567, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ORTHOPTERA', 'CÁNH THẲNG', 'ORD_057', 'Acrididae', 'Châu Chấu', 'FAM_003', 'Oxya', NULL, 'GEN_1412', 'oxyajaponica', 'Oxya japonica', '(Thunbery) 1824', '', 'SPA_02578', 'Toàn thân có màu xanh nâu sẫm; một dải màu đen bắt đầu từ mỗi mắt dọc theo rìa trên của thùy bên tiếp tục lên đến biểu mô; tegmen với vùng ven biển hơi đục; cánh trong suốt; xương chày sau màu xanh.| Đầu: Mượt; mắt hình bầu dục; dạng sợi anten, có lông mịn; râu ngắn hơn một chút so với đầu và pronotum; fastigium nằm ngang, đỉnh tròn, nhẵn và hợp dần với gờ trán; fastigium có độ lõm, gờ phía trước gần như song song, có rãnh; carina bên thẳng, phát sinh từ gốc mắt; mặt đầy lông.| Mesosoma: Pronotum nhẵn, thủng mịn; carina giữa yếu chỉ nhìn thấy được ở metazona; có 4 rãnh ngang; đầu tiên chỉ ở thùy bên; pronotum có lông thưa rất mịn; thùy bên có nhiều lông hơn; prozona gần bằng metazona; mỏm trước hình nón hơi dẹt về phía trước và có đỉnh nhọn, có lông; thùy trung mạc ngăn cách bởi không gian hẹp; thùy di căn tiếp giáp; tấm trung xương ức có lông; tegmen đã phát triển đầy đủ, vượt ra ngoài khối di căn và xương đùi sau; mép trước gai yếu; phần phụ có lông; xương đùi sau kéo dài ra ngoài đỉnh của khối u di căn một chút; vùng trên và dưới có ít lông mịn; phần đỉnh của xương chày sau mở rộng; 9 gai ngoài bao gồm gai đỉnh và 10 gai trong ở xương chày sau.| Metasoma: Van buồng trứng có vết lõm ngắn; hạch nền sau bụng có gai lớn ở rìa bụng trong; tấm dưới bộ phận sinh dục có hai đường gờ dọc trên bề mặt bụng với một gai ở đỉnh; rìa sau có một cặp gai giữa nằm sát nhau.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'indiabiodiversity.'),
(2568, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ORTHOPTERA', 'CÁNH THẲNG', 'ORD_057', 'Acrididae', 'Châu Chấu', 'FAM_003', 'Oxya', NULL, 'GEN_1412', 'oxyasp1', 'Oxya sp1', NULL, NULL, 'SPA_02579', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2569, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ORTHOPTERA', 'CÁNH THẲNG', 'ORD_057', 'Acrididae', 'Châu Chấu', 'FAM_003', 'Oxya', NULL, 'GEN_1412', 'oxyavelox', 'Oxya velox', '(Fabr.) 1787', '', 'SPA_02580', 'Màu xanh lục nâu, hoặc nâu trên lưng, màu xanh lục ở bên, đầu nằm sau mắt kép, với các sọc dọc màu nâu sẫm sáng dọc theo mép trên của các phiến bên của lớp đệm. Các cánh trước màu nâu; các cánh sau trong suốt và nhạt màu, với các đường vân sẫm màu. Con cái sau màu xanh lục hoặc nâu, màu nâu sẫm. Xương chày sau có màu xanh lam, đáy và cuối sẫm màu, đỉnh xương chày màu đen. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'UBND tinh Bac Kan'),
(2570, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ORTHOPTERA', 'CÁNH THẲNG', 'ORD_057', 'Acrididae', 'Châu Chấu', 'FAM_003', 'Phaleopa', NULL, 'GEN_1521', 'phaleopaantennata', 'Phaleopa antennata', 'B. –W., 1893', '', 'SPA_02581', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2571, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ORTHOPTERA', 'CÁNH THẲNG', 'ORD_057', 'Acrididae', 'Châu Chấu', 'FAM_003', 'Phlaeoba', NULL, 'GEN_1535', 'phlaeobainfumata', 'Phlaeoba infumata', 'B. –W., 1893', '', 'SPA_02582', 'Con cái lớn hơn con đực. Phần thân tương đối rộng và bằng phẳng, các đường gờ bên rõ ràng và song song và thường có nhiều gờ dọc ngắn bổ sung giữa các gờ giữa và gờ bên; cạnh trước thẳng, cạnh sau có góc tù; cạnh sau rãnh nằm trên tấm lưng ở giữa phía sau. Các râu ngắn và không chạm đến mép sau của pronotum. Các thùy bên của bụng sau ngực được tách biệt rõ ràng. Màu sắc cơ thể nâu vàng hoặc nâu sẫm. Với dải tối sau mắt. Các xúc tu có cùng màu, không có nút nhạt ở đỉnh. Các cánh sau trong suốt, phía trên không khói hoặc hơi hun khói. Đầu gối sẫm màu hơn. Xương chày sau có màu nâu vàng nhạt hoặc nâu lục ô liu. Chiều dài cơ thể: ♂19.0-23.0 mm, ♀28.0-31.0 mm. Chiều dài cánh trước: ♂17,0-20,0 mm, ♀21,0-24,0 mm. Chiều dài xương đùi bàn chân sau: ♂11,0-14,0 mm, ♀14,0-17,0 mm. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'UBND tinh Bac Kan'),
(2572, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ORTHOPTERA', 'CÁNH THẲNG', 'ORD_057', 'Acrididae', 'Châu Chấu', 'FAM_003', 'Phlaeoba', NULL, 'GEN_1535', 'phlaeobasp1', 'Phlaeoba sp1', NULL, NULL, 'SPA_02583', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
