(2574, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ORTHOPTERA', 'CÁNH THẲNG', 'ORD_057', 'Acrididae', 'Châu Chấu', 'FAM_003', 'Pternoscirta', NULL, 'GEN_1675', 'pternoscirtacalginosa', 'Pternoscirta calginosa', '(De Haan)', '', 'SPA_02585', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2575, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ORTHOPTERA', 'CÁNH THẲNG', 'ORD_057', 'Acrididae', 'Châu Chấu', 'FAM_003', 'Pternoscirta', NULL, 'GEN_1675', 'pternoscirtasauteri', 'Pternoscirta sauteri', 'Karny, 1923.', '', 'SPA_02586', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2576, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ORTHOPTERA', 'CÁNH THẲNG', 'ORD_057', 'Acrididae', 'Châu Chấu', 'FAM_003', 'Spathosternum', NULL, 'GEN_1837', 'spathosternumprasiniferum', 'Spathosternum prasiniferum', '(Walker, 1871)', NULL, 'SPA_02587', 'Màu sắc: Nguyên liệu tươi thường có màu xanh lục; một dải màu đen rộng đặc trưng chạy từ sau mắt tới phần trước dọc theo carinae bên; tegmina màu nâu nhạt với các vệt nhạt ở giữa dọc; cánh trong suốt, có mây về phía đỉnh; xương đùi sau có màu xanh lục hoặc có màu rufotestaceous; xương chày sau xanh.| Đầu: Lồi; fastigium tròn với carinulae bên hơi nhô lên, rõ ràng hơn ở con đực; foveolae đã lỗi thời; carina giữa yếu kéo dài đến đỉnh; gờ phía trước hẹp, hai mặt song song, có rãnh xuyên ra ngoài; Ăng-ten 21 phân đoạn, ngắn hơn đầu và pronotum gộp lại.| Mesosoma: Pronotum phẳng, tricarinate, có ba rãnh, carina ở giữa chỉ đi qua rãnh sau; prozona gần bằng metazona; rìa sau của đại từ có góc cạnh; mỏm trước sau bị nén lại, có hai thùy, nghiêng về phía sau, đáy hẹp hơn; thùy trung ức tách biệt; thùy di căn tiếp giáp; xương chày sau dài, ít giãn, có 10-11 gai ngoài đỉnh.| Metasoma: Cerci ngắn, hình trụ; tấm trên hậu môn cùn có rãnh dọc.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'indiabiodiversity'),
