(2655, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ORTHOPTERA', 'CÁNH THẲNG', 'ORD_057', 'Tettigoniidae', 'Muồm Muỗm', 'FAM_372', 'Hexacentrus', NULL, 'GEN_0879', 'hexacentrussp', 'Hexacentrus sp', NULL, NULL, 'SPA_02667', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2656, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ORTHOPTERA', 'CÁNH THẲNG', 'ORD_057', 'Tettigoniidae', 'Muồm Muỗm', 'FAM_372', 'Hexacentrus', NULL, 'GEN_0879', 'hexacentrusunicolor', 'Hexacentrus unicolor', '(Serville) 1931', '', 'SPA_02668', '. Con đực: Thân hình vừa phải và thon thả. Ăng-ten có các dải màu tối ngắn xen kẽ ở đỉnh. Fastigium có đỉnh hình tam giác, hẹp; bị nén ngang bởi một rãnh dọc ở giữa; đỉnh tròn khi nhìn từ bên; gốc fastigium rộng 1,88 lần vảy; fastigium của đỉnh được ngăn cách với fastigium của lá lược bằng một rãnh sâu. Mắt hình cầu. Pronotum hình yên ngựa, vùng lưng dài hơn chiều rộng và mở rộng về phía sau, hơi lõm xuống phía sau rãnh ngang thứ nhất; có ba rãnh ngang, rãnh thứ hai và rãnh thứ ba giới hạn ở đĩa đệm; mép lưng phía trước hơi lõm, mép sau tròn rộng với một đường cắt bỏ nhẹ ở giữa. Một dải giống như đồng hồ cát bao phủ toàn bộ đại từ; carina giữa có thể nhìn thấy mờ nhạt. Đĩa trước phẳng, nở rộng, tròn rộng và có độ nhám cao ở vùng sau; thùy bên của đại từ nghiêng; dài hơn cao; vắng mặt xoang hàm. Prosternum được trang bị hai gai dài; mesosternum và metasternum được trang bị một cặp xương ức ngắn và dày. Lỗ thính giác ngực lớn, hình bầu dục, hơi ẩn dưới thùy bên của đại từ với một củ ở rìa giữa phía trước. Tegmina (hẹp ở con đực) dài hơn cánh sau. Tegmen vươn xa hơn giữa xương chày sau khi thẳng; đỉnh tròn. Dũa có 46 răng; sunfat vừa phải; các răng có chiều dài gần như bằng nhau trong toàn bộ trâm ngoại trừ đầu xa nơi nó trở nên hẹp dần và hẹp đột ngột về phía đầu gần với ít răng. Chân: các thùy xương đùi trước được trang bị một gai đơn ở mặt trong và không có gai ở mặt ngoài; thùy gen giữa được trang bị một gai duy nhất ở cả bên trong và bên ngoài; thùy gen sau được trang bị bispinose ở cả hai bên. Mũi coxae được trang bị một cột sống hướng ra ngoài về phía trước. Tất cả các xương đùi đều không có vũ khí. Xương đùi trước được trang bị các gai dài từ 4 đến 5 phút với các gai nhỏ ở rìa trong và rìa ngoài. Xương đùi giữa được trang bị các gai nhỏ ở rìa trong; Các gai 2 – 3 phút có nhiều gai phút hơn ở rìa ngoài. Xương đùi sau có 7 – 8 gai trung bình ở rìa trong và rìa ngoài. Tympanum trên xương chày trước đóng kín hai bên, các khe màng nhĩ hướng về phía lưng với một hố nhỏ, thon dài bên dưới. Xương chày trước được trang bị ở phần bụng với 6 gai dài, có thể di chuyển, cong ra ngoài, có chiều dài giảm dần từ gốc đến đỉnh ở rìa trong và rìa ngoài. Xương chày giữa có 2 gai nhỏ ở rìa trong và rìa ngoài. Xương chày giữa được trang bị ở phần bụng với 6 gai dài, có thể di chuyển được, cong ra phía ngoài, giảm chiều dài từ gốc đến đỉnh ở rìa trong và ngoài. Xương chày sau có 40 – 42 gai ở mặt lưng, mỗi gai ở rìa trong và ngoài. Xương chày sau được trang bị ở phần bụng với 10 – 12 gai tăng dần về chiều dài và mật độ từ gốc đến đỉnh ở rìa trong, 12 – 14 gai tăng dần về chiều dài và mật độ từ gốc đến đỉnh ở rìa ngoài. Một cặp cựa lưng đơn và hai cặp cựa bụng (nhỏ bên trong và lớn bên ngoài) hiện diện ở vùng đỉnh của xương chày sau. Tergite thứ chín bị cắt bỏ yếu ớt. Bụng thứ mười với vết cắt sâu và. Tấm trên hậu môn hình tam giác có rãnh đáy; miễn là rộng. Tấm dưới sinh dục dài với rãnh dọc ở giữa ở đỉnh, các đường gờ bên phát triển tốt, mép đỉnh có đường cắt tròn; về cơ bản có kiểu dáng phân kỳ, đỉnh hơi cong. Cerci khỏe mạnh với một củ nhỏ ở mặt trong, sau đó đột ngột thu hẹp lại thành một phần phụ ở đỉnh dạng ngón dài với đỉnh bị cong. Nữ: Bụng thứ 10 với đường rạch dọc ở giữa. Tấm trên hậu môn hình tam giác có rãnh lưng, đỉnh cụt; Paraprocts có hình chiếu tam giác ở đỉnh. Tấm dưới cơ quan sinh dục có đáy rộng, đỉnh có đường cắt ở giữa yếu. Cổ tử cung hình nón, dày, đỉnh có phần phụ hình nón nhẵn. Cơ quan đẻ trứng rộng ở gốc; đỉnh hẹp; hơi cong lên. Hình thái (chiều dài tính bằng mm)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'gbif'),
