(2662, 'ARTHROPODA', 'CHÂN KHỚP', 'PHY_02', 'INSECTA', 'CÔN TRÙNG', 'CLA_07', 'ORTHOPTERA', 'CÁNH THẲNG', 'ORD_057', 'Tettigoniidae', 'Muồm Muỗm', 'FAM_372', 'Onomarchus', NULL, 'GEN_1372', 'onomarchusuninotatus', 'Onomarchus uninotatus', '(Serville) 1839.', '', 'SPA_02674', 'Sải cánh thay đổi từ 160-170. Mẫu vật được cung cấp trên nền thẻ có cánh xòe ra. Thân và chân của loài côn trùng này có màu nâu xanh. Cánh trước có hình dạng như một chiếc lá. Trên một số mẫu vật, cánh trước có màu nâu nhạt với các đường gân màu đỏ đậm, trong khi ở một số mẫu khác, cánh trước có màu xanh lục với các mảng màu trắng hồng. Cánh sau có một phần trong suốt được phủ các đường gân màu xanh lá cây hoặc nâu, mép ngoài và đầu cánh sẫm màu hơn một chút. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'World of Butterflies and Moths'),
