(2707, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Channidae', 'Cá Sơn', 'FAM_073', 'Channa', NULL, 'GEN_0363', 'channaasatica', 'Channa asatica', '(Linnaeus, 1758)', 'Cá chèo đồi', 'SPA_02719', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2708, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Channidae', 'Cá Sơn', 'FAM_073', 'Channa', NULL, 'GEN_0363', 'channagachua', 'Channa gachua', 'Hamilton, 1822', 'Tràu suối ', 'SPA_02720', 'Chiều dài tới 29 cm (11 inch) nhưng trung bình chỉ khoảng 5 cm (2 inch) và trọng lượng tới 0,2 kg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2709, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Channidae', 'Cá Sơn', 'FAM_073', 'Channa', NULL, 'GEN_0363', 'channalucius', 'Channa lucius', '(Cuvier, 1831)', 'cá tràu dày', 'SPA_02721', 'Cá có chiều dài 1,5-40,5 cm, khối lượng 0,05-680g/con. Cá dày hình dáng giống cá lóc, đầu dài, nhọn; bụng có nhiều vệt đen, trắng xen kẻ. Ở Việt Nam cá Dày là loài cá bản địa và chỉ có một loài duy nhất là Channa lucius Cuvier, 1831 được tìm thấy trong các thủy vực nước ngọt như sông hồ, kênh rạch, ruộng lúa và trong các khu rừng bảo tồn thiên nhiên ở ĐBSCL (Trương Thủ Khoa và Trần Thị Thu Hương (1993).\nCá dày sống tốt ở môi trường nước có nhiệt độ dao động từ 15-390C và ngưỡng pH đạt từ 2,7-10,3. Ngoài ra, còn thích nghi tốt với môi trường nước có độ mặn đạt ngưỡng cao khoảng 22%o. Tuy nhiên, khả năng chịu phèn rất kém. ', NULL, 'Cà Mau Thái Lan, Lào, Campuchia ', NULL, NULL, NULL, NULL, NULL, NULL, 'tepbac.com'),
(2710, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Channidae', 'Cá Sơn', 'FAM_073', 'Channa', NULL, 'GEN_0363', 'channamaculata', 'Channa maculata', '(Lacèpède, 1801)', 'Cá Lóc bông, Chuối hoa', 'SPA_02722', 'Cá có cỡ trung bình, thân trụ tròn dài, phần sau dẹp bên. Đầu dài nhọn. Miệng rất lớn, rạch xiên kéo dài quá viền sau mắt. Trên hai hàm, xương lá mía và xương khẩu cái đều có răng nhỏ. Mũi nhọn dài, mỗi bên đầu có 2 lỗ mũi. Hai bên má có hệ thống lỗ nhỏ, sắp xếp theo quy luật. Mắt lớn, khoảng cách 2 mắt rộng, hơi lồi. Vây lưng và vây hậu môn rất dài và đều là tia mềm không nối liền với vây đuôi. Vây ngực tròn, vây bụng bé. Đỉnh đầu có vảy hình tấm tương đối bé. Đường bên gián đoạn. Cá màu xám nâu, xen kẽ các vạch chấm đen. Dọc thân có hai hàng chấm đen. Gốc vây lưng có 1 hàng chấm đen lớn. Đầu có 1 vạch đen gãy khúc chạy từ mắt đến gốc vây lưng. Trên các vây phần lớn chấm đen xếp thành hàng. Sống ở các sông ngòi, ao hồ, đồng ruộng ngập nước, nơi có nhiều thực vật thủy sinh. Về mùa rét cá dễ bị nhiễm bệnh nấm có thể lây lan thành dịch bệnh làm chết hàng loạt. Cá có thể sống ở các vùng nước có hàm lượng oxy thấp nhờ có cơ quan hô hấp phụ. Cá chuối hoa là loài cá dữ điển hình, ăn nhiều cá con, ếch nhái, tôm cua, côn trùng và ấu trùng... Cá sinh trưởng nhanh, 1 tuổi đạt 0,5kg; 2 tuổi đạt 1,2 - 1,5kg; 3 tuổi đạt 1,8 - 2,5kg; 4 tuổi đạt 3,5 - 4kg; lớn nhất có thể đạt tới 10 - 12kg/con. Cá thành thục vào năm thứ 2. Mùa sinh sản từ tháng 5 - 10, tuỳ theo vùng có thể sớm hoặc muộn hơn. Đến mùa sinh sản cá thường sống từng đôi, làm tổ ở các vùng gần bờ ao, đầm, hồ, ruộng nước, sông ngòi. Chúng thường dọn sạch các cây cối thuỷ sinh tạo thành khoảng trống, mặt thoáng với độ rộng từ 0,4 - 0,6m2 để đẻ trứng vào đó. Trứng nổi trên mặt nước và dính lại với nhau thành đám. Cá đực và cá cái quanh quẩn gần tổ để bảo vệ trứng và chăm sóc con cái đến khi cá con tự kiếm ăn và tránh được kẻ thù. Cá đẻ thành nhiều đợt trong mùa đẻ, mỗi đợt từ 5.000 - 30.000 trứng, tuỳ theo kích thước của cá cái.', NULL, 'Các tỉnh phía Bắc cho tới Thanh Hoá (Nguyễn Thái Tự, 1983). Trung Quốc.', NULL, NULL, 'Loài cá quí, hiếm mặc dù sản lượng cá tự nhiên ở đồng bằng Bắc bộ khá cao, kể cả vùng nước lợ ven biển. Cá có triển vọng là đối tượng nuôi xuất khẩu.', 'EU', NULL, NULL, 'vncreatures.net'),
(2711, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Channidae', 'Cá Sơn', 'FAM_073', 'Channa', NULL, 'GEN_0363', 'channamarulius', 'Channa marulius', '(F. Hamilton, 1822)', 'Cá lóc núi', 'SPA_02723', 'Cá cỡ nhỏ, thân thon dài, đầu dẹp bằng, phía sau dẹp bên. Miệng lớn, rạch xiên kéo dài về phía sau đến quá viền sau mắt. Trên 2 hàm, xương khẩu cái và xương lá mía đều có răng nhọn. Lưỡi tròn. Mỗi bên có 2 lỗ mũi: Lỗ mũi trước hình ống, lỗ mũi sau hình nón nằm cách xa nhau. Mắt to, nằm ở phía trước lưng của đầu. Khoảng cách sau ổ mắt gấp 3 lần khoảng cách trước ổ mắt. Vây lưng có khởi điểm sau khởi điểm vây bụng và trước khởi điểm vây bụng, không có tia gai cứng. Vây ngực dài và lớn. Vây bụng bé. Vây đuôi dài, mút cuối tròn. Hậu môn nằm sát vây hậu môn. Vảy hình tấm ở trên đầu. Thân phủ vảy lược lớn. Đường bên không liên tục, chạy từ sau nắp mang đến khoảng sau vây ngực thì gãy khúc xuống 1 hàng vảy và chạy vào giữa cán đuôi. Cá có màu nâu thẫm, bụng nhạt hơn lưng, gốc vây đuôi về phía trên có 1 chấm đen, có viền trắng giống như con mắt. Cá sống ở khu vực nước tĩnh hoặc chảy chậm, thường có ở các kênh mương, ao hồ và đầm lầy. Cá sống trong các vùng nước có nhiều cây cỏ thuỷ sinh ven bờ. Cá thuộc loại cá dữ, thức ăn chính là các loại cá con, ếch nhái và một số động vật không xương sống. Cá có kích thước lớn, tối đa 120cm (Rainboth, 1996). Cá tràu mắt 2 tuổi bắt đầu thành thục. Mùa sinh sản từ tháng 5 - 10. Các đặc điểm sinh học khác cũng tương tự các loài trong giống Channa.', NULL, 'Gia Lai (sông Ba - An Khê), Đắk Lắk (sông Sesan). Ấn Độ, Trung Quốc, Thái Lan.', NULL, NULL, 'Cá tràu mắt có kích thước lớn và thuộc loại cá hiếm cần được bảo vệ. Cá có thể nuôi thương phẩm.', 'DD', NULL, NULL, 'vncreatures.net'),
(2712, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Channidae', 'Cá Sơn', 'FAM_073', 'Channa', NULL, 'GEN_0363', 'channamicropeltes', 'Channa micropeltes', '(Cuvier, 1831)', 'cá lóc bông', 'SPA_02724', 'Chiều dài 1,3 m (4,3 ft) và khối lượng 20 kg (44 lb).', NULL, 'Cá lóc bông sống ở vùng Đông Nam Á, gồm lưu vực sông Mekong và sông Chao Phraya ở Campuchia, Lào, Thái Lan và Việt Nam, cũng như Bán đảo Mã Lai, hai đảo Borneo và Sumatra.Tại Việt Nam, cá lóc bông sinh sống chủ yếu ở các vực nước thuộc hệ thống sông Cửu Long cũng như sông Đồng Nai và sông Sài Gòn ở Nam Bộ và một số sông ở Tây Nguyên.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2713, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Channidae', 'Cá Sơn', 'FAM_073', 'Channa', NULL, 'GEN_0363', 'channaorientalis', 'Channa orientalis', 'Bloch & Schneider, 1801', 'cá chuối suối', 'SPA_02725', 'Đầu dẹp bằng cao, chiều dài đầu nhỏ hơn 1,5 lần chiều cao đầu. Rạch miệng xiên nhiều, kéo dài về sau tới hoặc quá viền sau mắt 1 ít. Lưỡi dẹp, hình tam giác dài, mút hơi tròn, 2 bên bằng thẳng. Đầu dẹp bằng thấp, chiều dài đầu lớn hơn 2 lần chiều cao đầu. Miệng hình cung sâu và hẹp, chiều dài lớn hơn chiều rộng. Rạch miệng xiên ít, kéo dài về sau tới ngang giữa mắt hoặc chưa tới viền sau mắt. Lưỡi dẹp, mút hơi nhọn dạng hình mũi mác, có eo thắt ngang ở giữa. Rạch miệng kéo dài về sau quá viền sau mắt một khoảng bằng đường kính mắt.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Channa_orientalis'),
(2714, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Channidae', 'Cá Sơn', 'FAM_073', 'Channa', NULL, 'GEN_0363', 'channastriata', 'Channa striata', '(Bloch, 1793)', 'cá lóc', 'SPA_02726', 'Vây lưng có 40 - 46 vây; vây hậu môn có 28 - 30 tia vây, vảy đường bên 41 - 55 cái. Ðầu cá quả O.maculatus có đường vân giống như chữ \"nhất\" và 2 chữ bát còn đầu cá O.arbus tương đối nhọn và dài giống như đầu rắn.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2715, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Helostomatidae', 'Cá Hường', 'FAM_176', 'Helostoma', NULL, 'GEN_0843', 'helostomatemmincki', 'Helostoma temmincki', 'Cuvier, 1829', 'cá mùi', 'SPA_02727', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2716, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Nandidae', 'Cá Rô Biển', 'FAM_256', 'Pristolepis', NULL, 'GEN_1627', 'pristolepisfasciata', 'Pristolepis fasciata', '(Bleeker, 1851)', 'cá rô biển', 'SPA_02728', 'có chiều dài tối đa 20 cm, thân cao, dẹp bên, cuống đuôi rất ngắn, đầu lớn vừa, dẹp bên, mõm ngắn, không nhô ra, rộng ngang, rạch xiên, hàm trên kéo dài hơi quá viền trước mắt, trên hàm có răng nhỏ nhọn, mắt lớn, nằm ở nửa trên của đầu, cạnh dưới xương trước mắt có răng cưa nhọn, lỗ mang lớn, cạnh dưới và sau xương nắp mang trước có răng cưa nhỏ nhọn, xương nắp mang có 2 gai dẹt, màng mang 2 bên dính liền nhau, phủ vẩy dày và liền với eo. Vây lưng có khởi điểm nằm trước khởi điểm vây ngực và ngang với mép trên của lỗ mang, gốc vây lưng dài, gốc sau cùng cách gốc vây đuôi 4 đến 6 hàng vẩy, vây hậu môn có khởi điểm ngang với tia vây thứ hai của vây lưng và gần gốc vây đuôi hơn mõm, gai thứ 2 to và dài hơn các vây khác, gai vây lưng, vây hậu môn cứng và nhọn, vây đuôi tròn. Thân và đầu phủ vẩy lược, có nhiều vẩy nhỏ phủ lên gốc tia mềm của vây lưng, vây hậu môn và một phần gốc vây đuôi, đường bên không liên tục. Mặt lưng có màu xám đậm, phía bụng nhạt dần và bụng có màu trắng, thân và đầu ửng vàng, các vây bụng, vây lưng, vây hậu môn và vây đuôi xám đen. Kỳ trên và kỳ dưới cá rô biển đều bén nhưng không đâm; Loài này được biết là xuất hiện ở các con sông lớn ở vùng ngập lụt đến cửa sông cũng như các hồ, ao và đầm lầy. Nó đã được quan sát thấy là loài di cư nước ngọt, di cư từ sông Mê Kông đến vùng đồng bằng ngập lụt trong các trận lũ lụt trong mùa gió mùa và trở lại sông vào đầu mùa khô.[', NULL, 'miền nam Việt Nam) Là loài bản địa của lưu vực sông Mê Kông, Chao Phraya (Campuchia, Lào, Thái Lan, miền nam Việt Nam), Malaysia (cả phần thuộc Borneo), Indonesia (Sumatra, phần thuộc Borneo).', NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
(2717, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Osphronemidae', 'Cá Tai Tượng', 'FAM_265', 'Osphronemus', NULL, 'GEN_1407', 'osphronemusexodon', 'Osphronemus exodon', 'T.R. Roberts, 1994', 'Cá Rô cờ', 'SPA_02729', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2718, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Osphronemidae', 'Cá Tai Tượng', 'FAM_265', 'Osphronemus', NULL, 'GEN_1407', 'osphronemusgouramy', 'Osphronemus gouramy', 'Lacepede, 1801', 'cá tai tượng', 'SPA_02730', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2719, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Osphronemidae', 'Cá Tai Tượng', 'FAM_265', 'Osphronemus', NULL, 'GEN_1407', 'osphronemuslaticlavius', 'Osphronemus laticlavius', '(Roberts, 1992)', '', 'SPA_02731', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2720, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Osphronemidae', 'Cá Tai Tượng', 'FAM_265', 'Trichogaster', NULL, 'GEN_1981', 'trichogastermicrolepis', 'Trichogaster microlepis', '(Gũnther, 1861)            ', 'Cá Sặc bạc, cá sặc điệp', 'SPA_02732', 'Cá có chiều dài tối đa 13 cm. Thân hình bầu dục hơi dài, dẹp bên; phần lưng lõm xuống ở gáy, mõm nhọn và hướng lên trên; miệng nhỏ, rạch miệng xiên cách xa viền trước mắt; răng trên 2 hàm nhỏ mịn; mắt to, nằm lệch về nửa trên của đầu. Cá có màu trắng bạc hay xám, phần lưng hơi sẫm, bụng nhạt, ở cá đực có thể có 1 sọc đen chạy từ mắt đến cuống đuôi và chấm dứt bằng 1 đốm tròn. Vây lưng nhỏ, gốc vây ngắn, khởi điểm gần gốc vây đuôi hơn mút mõm; 3-4 gai cứng thấp hơn phần tia mềm; vây hậu môn phần gai trước thấp, phần tia mềm sau phát triển cao hơn; vây ngực dài quá khởi điểm vây bụng; vây bụng có gai thoái hóa, tia mềm thứ nhứt kéo dài quá mút vây đuôi và phân đốt rõ rệt; vây đuôi phân thùy cạn, mút cuối hơi tròn. Vảy lược nhỏ phủ khắp thân và đầu, có nhiều vảy nhỏ phủ lên gốc vây hậu môn và vây đuôi; 57-65 vảy trên đường bên, 34-40 vảy ngang.\nLà một loài cá có mê lộ, có khả năng lấy oxy từ không khí nên cá sặc điệp có thể sống trong môi trường nước nghèo oxy như ruộng lúa, đầm lầy hay vũng nước tù đọng. Cá đẻ trứng tổ bọt, mỗi tổ 500-1.000 trứng, cá đực chăm sóc tổ trứng và cá con khi mới nở.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/C%C3%A1_s%E1%BA%B7c_%C4%91i%E1%BB%87p'),
(2721, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Osphronemidae', 'Cá Tai Tượng', 'FAM_265', 'Trichogaster', NULL, 'GEN_1981', 'trichogasterpectoralis', 'Trichogaster pectoralis', 'Regan, 1909', 'cá sặc rằn', 'SPA_02733', 'Cá sặc rằn trưởng thành dài trung bình 15 cm, cá biệt có thể lên đến 25 cm[4]. Chúng có thân mình dẹt, hơi thuôn hình bầu dục, phủ kín các họa tiết vằn vện tối màu; miệng nhọn hướng lên trên và vây bụng dạng sợi đặc trưng của chi Cá sặc.', NULL, 'Cá phân bố ở xung quanh lưu vực sông Mekong của Lào, Thái Lan, Campuchia và Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/C%C3%A1_s%E1%BA%B7c_r%E1%BA%B1n'),
(2722, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Osphronemidae', 'Cá Tai Tượng', 'FAM_265', 'Trichopodus', NULL, 'GEN_1983', 'trichopodustrichopterus', 'Trichopodus trichopterus', '(Pallas, 1770)', 'Cá sặc bướm', 'SPA_02735', 'Cá sặc bướm thuộc họ cá tai tượng. Cá sặc bướm là loài cá bản địa có tiềm năng trở thành đối tượng nuôi mới. Là loài cá ăn tạp thực vật, động vật phiêu sinh, giáp xác và mùn bã hữu cơ nhưng thiên về thực vật phiêu sinh. Hệ số tương quan chiều dài ruột và chiều dài thâm cá (RLF) là 4,81 + 0,91.\nĐặc điểm hình thái của cá sặc bướm. D (bi lưng) VI – VII, 7 – 10; P (vi ngực) 8 – 10; V (vi bụng) 3: Vi hậu môn: 30 – 38, C (vi đuôi) 14 – 18, số lược mang (Gr) 65 – 78.\nCơ thể cá sặc bướm thuộc dạng dẹp bên với đầu nhỏ, mõm ngắn, nhọn. Vi lưng nhỏ, con đực có vi lưng kéo dài qua gốc vi đuôi, con cái có vi lưng ngắn hơn và chưa chạm đến gốc vi đuôi. Trên vi hậu môn, vi lưng và vi đuôi có các chấm nhỏ li ti màu đỏ cam.', NULL, 'Một số nước lưu vực sông Mêkông: Thái Lan, Lào, Campuchia và Việt Nam.', NULL, NULL, ' ít quan trọng trong ngư nghiệp và chăn nuôi. Thường được ướp muối và phơi khô để trữ làm thực phẩm. Loài cá này cũng rất phổ biến trong lãnh vực cá cảnh, những dòng cá cảnh như cá sặc cẩm thạch (marble gourami) hay cẩm thạch vàng (golden gourami) cũng xuất phát từ loài này. ', NULL, NULL, NULL, 'https://tepbac.com/species/full/348/ca-sac-buom.htm'),
(2723, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Osphronemidae', 'Cá Tai Tượng', 'FAM_265', 'Trichopsis', NULL, 'GEN_1984', 'trichopsispumila', 'Trichopsis pumila', '(Arnold, 1936)', 'Cá thanh ngọc lùn, cá bãi trầu lùn', 'SPA_02736', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2724, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANABANTIFORMES', 'CÁ RÔ ĐỒNG', 'ORD_001', 'Osphronemidae', 'Cá Tai Tượng', 'FAM_265', 'Trichopsis', NULL, 'GEN_1984', 'trichopsisvittata', 'Trichopsis vittata', '(Cuvier, 1831)', 'cá bã trầu', 'SPA_02737', 'Cá có chiều dài khoảng 4–7 cm.[2] Gai vây hậu môn: 6-8. Có 24-28 tia mềm vây hậu môn phân nhánh; 13 hàng vảy nằm ngang; và từ 2 trở lên các sọc sẫm màu nằm dọc theo thân. Vây hậu môn với một ít tia vây mềm giống như sợi chỉ thuôn dài, mở rộng về phía sau gần như tới chỏm vây đuôi; có vết đen phía trên gốc ngực.[2] Cá đực to khi ở trong trạng thái sung mãn thì có màu xanh ngọc. Cá có mõm nhọn và thân dẹt.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2725, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANGUILLIFORMES', 'CÁ CHÌNH', 'ORD_002', 'Anguillidae', 'Cá Chình', 'FAM_020', 'Anguilla', NULL, 'GEN_0095', 'anguillabengalensis', 'Anguilla bengalensis', '(Gray, 1831)', NULL, 'SPA_02738', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2726, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANGUILLIFORMES', 'CÁ CHÌNH', 'ORD_002', 'Anguillidae', 'Cá Chình', 'FAM_020', 'Anguilla', NULL, 'GEN_0095', 'anguillajaponica', 'Anguilla japonica', '(Temminck & Schlegel, 1847)', 'Cá chình', 'SPA_02739', 'Cá cỡ trung bình, thân hình trụ dài, dạng rắn. Miệng rộng ở mút mõm. Rạch miệng kéo dài về sau tới viền sau mắt. Vây lưng nằm lùi về phía sau, liên tục với vây đuôi và vây hậu môn. Khoảng cách giữa khởi điểm vây lưng và khởi điểm vây hậu môn ngắn hơn chiều dài đầu. Vây ngực tồn tại. Vây bụng thiếu. Cá có màu nâu sáng, ánh xanh Cá chình nhật ở ngoài tự nhiên vì thiếu thức ăn nên rất chậm lớn. Năm thứ nhất cá dài 6cm nặng 0,1g, năm thứ hai dài 15cm nặng 5g, năm thứ ba dài 25cm nặng 15g, năm thứ tư đạt cỡ thương phẩm 150g. Cá chình nhật thường có chiều dài 40 - 50cm, nặng 200 - 300g, cũng có con đạt 0,9 - 1m nặng 4 - 5kg. Cá chình nhật thuộc loại cá dữ. ở giai đoạn cá giống chúng ăn chủ yếu là luân trùng, giun ít tơ, ấu trùng côn trùng. Chúng cũng ăn các loài ốc hến, mảnh vụn hữu cơ. Khi cá nặng 5g trở lên bắt đầu ăn cá con và xác động vật chết. Cá chình nhật sống ở nước ngọt, khi thành thục di cư ra biển sinh sản. Vòng đời của cá chưa biết chắc chắn. Cá sống ở nước ngọt, tuyến sinh dục không thể thành thục được. Hàng năm đến mùa sinh sản cá bố mẹ kết đàn từ sông hoặc đầm hồ ra biển. Trong hành trình cá di chyển trên biển tuyến sinh dục chín dần và cuối cùng đến bãi đẻ ở ngoài biển sâu để đẻ trứng. Trứng nở ra thành ấu trùng dạng dẹt hình lá liễu. Qua biến thái nhiều lần thành Cá chình con. Cá con theo dòng hải lưu hoặc sóng biển di cư vào ven bờ, các thuỷ vực nước ngọt nội địa để sinh sống và trưởng thành', NULL, 'Hà Nội (Thanh Trì: sông Hồng), các tỉnh ven biển Bắc Bộ Hải Dương, Hưng Yên, Nam Định, Thái Bình, Trung Trung Bộ (Quãng Ngãi, Bình Định) Trung Quốc, Triều Tiên, Nhật Bản', NULL, NULL, 'Cá có giá trị thương mại lớn. Thịt cá rất ngon, được nhiều người ưa chuộng và có thể xuất khẩu. Cá chình nhật là loài cá quý được nuôi nhiều ở Nhật Bản và Trung Quốc. Ở nước ta, nhiều vùng đã thí điểm nhập giống Cá chình nhật từ Trung Quốc về nuôi và bước đầu đã có kết quả', 'EW', NULL, NULL, 'Vn Creature'),
(2727, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'ANGUILLIFORMES', 'CÁ CHÌNH', 'ORD_002', 'Anguillidae', 'Cá Chình', 'FAM_020', 'Anguilla', NULL, 'GEN_0095', 'anguillamarmorata', 'Anguilla marmorata', '(Quoy & Gaimard, 1824)', 'Cá Chình hoa', 'SPA_02740', 'Cá cỡ trung bình, thân hình ống dài hình rắn. Miệng rộng, rạch kéo dài quá viền sau mắt. Chiều dài đầu lớn hơn khoảng cách từ khe mang đến khởi điểm vây lưng lớn hơn hoặc nhỏ hơn 1 ít khoảng cách giữa khởi điểm vây lưng và khởi điểm vây bụng. Vây lưng có khởi điểm gần khe mang hơn tới hậu môn. Chiều dài mõm lớn hơn chiều rộng đáy miệng. Răng trên xương gian hàm và xương lá mía tạo thành dải rộng ở phía trước, hẹp dần về phía sau và kết thúc bằng mút nhọn. Răng trên xương hàm trên có khoảng trống giữa hàng răng phía trong và hàng răng phía ngoài. Dải răng trên xương lá mía kết thúc trước các dải răng trên xương hàm trên. Cá có màu sẫm ở phía lưng, màu sáng ở phía bụng, trên thân có nhiều chấm hoa đen. Cá có chiều dài từ 50 - 70cm ứng với khối lượng 0,3 - 1,1 kg, cỡ lớn nhất có thể đạt tới 1,2m và nặng 7 - 12kg. Cá Chình hoa thuộc loại cá dữ. Thức ăn là các loại động vật không xương sống, cá con... Cá sống ở nước ngọt nhưng đến khi thành thục cá di cư ra biển sâu để đẻ. Trứng nở thành ấu trùng dạng lá và nhờ dòng hải lưu, sóng đưa từ biển khơi vào ven bờ. Sau khi biến thái nhiều lần thành Cá chình con và di chuyển vào vùng nước ngọt nội địa sinh sống.', NULL, 'Hà Tĩnh (sông Ngàn Phố), Thừa Thiên - Huế (sông Hương), Gia Lai (An Khê - sông Ba), Kontum (hồ Đắc Uy), Quảng Ngãi (sông Trà Khúc), Bình Định (đầm Châu Trúc - huyện Phù Mỹ). Cămpuchia, Inđônêxia.', NULL, NULL, 'Cá chình hoa có thịt rất ngon và có giá trị xuất khẩu. Cá có triển vọng trở thành cá nuôi xuất khẩu.', 'VU', NULL, NULL, 'vncreatures.net'),
