(2740, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CHARACIFORMES', 'CÁ CHÉP MỠ', 'ORD_016', 'Characidae', 'Cá Chim Trắng', 'FAM_074', 'Colossoma', NULL, 'GEN_0453', 'colossomabrachypomum', 'Colossoma brachypomum', '(Cuvier, 1818)', 'Cá chim trắng nước ngọt', 'SPA_02753', 'Pacu bụng đỏ thường bị nhầm lẫn với các loài cá pacu khác (Piaractus mesopotamicus, Colossoma macropomum) hay piranha (Pygocentrus natteri) do bề ngoài tương tự nhau của chúng. Cơ thể chúng sâu và dẹp bên, với hai bên mình có màu trắng bạc và sẫm dần về phía gần lưng. Màu đỏ có ở bụng, cằm, vây ngực và đôi khi cũng có ở ở các tia vây trước của vây hậu môn. Các tia vây khác sẫm màu đồng nhất. Giống như ở các loài cá chép mỡ (Characiformes) khác, vây béo nhỏ không chia thành tia vây nằm ở khoảng giữa vây lưng và vây đuôi. Số lượng tia vây: Vây lưng = 15-18, vây ngực = 16-19, vây hậu môn = 24-28, vây chậu = 8[6]. Vài tia vây đầu tiên của vây lưng và vây hậu môn dài hơn các tia vây còn lại.', NULL, 'Khu vực sinh sống bản địa là lưu vực các sông Amazon và Orinoco tại Colombia, Venezuela, Peru, Bolivia và Brasil, cũng được ghi nhận có ở Argentina[3] nhưng đã du nhập vào nhiều nơi khác như Ấn Độ, Bangladesh, Canada, Đài Loan, Hoa Kỳ, Thái Lan, Trung Quốc và Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Piaractus_brachypomus'),
(2741, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CICHLIFORMES', 'CÁ HOÀNG ĐẾ', 'ORD_019', 'Cichlidae', 'Cá Rô Phi', 'FAM_085', 'Oreochromis', NULL, 'GEN_1391', 'oreochromismossambicus', 'Oreochromis mossambicus', '(Peters, 1852)', 'cá rô phi đen', 'SPA_02754', 'Thân hình thoi và dẹp bên rõ rệt. Chiều dài thân bằng 2,5 lần chiều cao. Vây ngực lớn dài bằng chiều dài đầu. Thân màu xám tro hoặc nâu nhạt, bụng xám trắng, mép rìa vây lưng màu đỏ, không có các vằn ngang trên thân. Chiều dài lớn nhất 30cm, thông thường 10 – 25 cm. Sinh trưởng rất nhanh, cá đực lớn nhanh hơn cá cái. Sau 4 tháng tuổi con đực nặng 30 – 40g, con cái 25 – 30g; sau 8 tháng con đực đạt 250 – 300g, con cái 150 – 200g. Sinh sản quanh năm, mỗi năm cá cái đẻ 5 – 6 lứa. Khi đẻ chúng đào ổ dưới đáy ao. Trứng sau khi đẻ và thụ tinh được cá mẹ hút vào miệng để ấp. Cá bột cũng được hút vào miệng khi gặp nguy hiểm trong 15 – 20 ngày đầu.', NULL, 'Ở Việt Nam có ở hầu hết các tỉnh. Có nguồn gốc từ các nước Đông Châu Phi. Đến nay đã di sang các nước: Nhật Bản, Trung Quốc, Đài Loan và một số nước Đông Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'Tepbac'),
(2742, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CICHLIFORMES', 'CÁ HOÀNG ĐẾ', 'ORD_019', 'Cichlidae', 'Cá Rô Phi', 'FAM_085', 'Oreochromis', NULL, 'GEN_1391', 'oreochromisniloticus', 'Oreochromis niloticus niloticus', '(Linnaeus, 1758)', 'cá rô phi vằn', 'SPA_02755', 'Thân cao, hình hơi bầu dục, dẹp bên. Đầu ngắn. Miệng rộng hướng ngang, rạch kéo dài đến đường thẳng đứng sau lỗ mũi một ít. Hai hàm dài bằng nhau, môi trên dầy. Lỗ mũi gần mắt hơn mõm. Mắt tròn ở nửa trước và phía trên của đầu. Khoảng cách hai mắt rộng, gáy lõm ở ngang lỗ mũi. Khởi điểm vây lưng ngang với khởi điểm vây ngực, trước khởi điểm vây bụng. Vây ngực nhọn, dài, mềm. Vây bụng to cứng, chưa tói lỗ hậu môn.oàn thân phủ vẩy, ở phần lưng có màu sáng vạng nhạt hoặc xám nhạt, phần bụng có màu trắng ngàhoạc màu xanh nhạt. Trên thân có từ 6-8 vạch sắc tố chạy từ lưng xuống bụng. Các vạch sắc tố ở các vây đuôi, vây lưng õ ràng hơn.\n Cá rô phi sinh trưởng và phát triển trong nước ngọt, nước lợ và có thể phát triển ở nước biển có độ mặn 32‰. Cá ăn tạp, thức ăn gồm các tảo dạng sợi, các loài động thực vật phù du, mùn bã hữu cơ, ấu trùng các loại côn trùng, động vật sống ở nước, cỏ, bèo, rau và cả phân hữu cơ. Ngoài ra chúng có khả năng ăn thức ăn bổ sung như cám gạo, bột ngô, bánh khô đậu, các phế phụ phẩm khác và thức ăn viên. Ở giai đoạn cá hương chúng ăn sinh vật phù du, chủ yếu là động vật phù du, một ít thực vật phù du. Giai đoạn cá giống đến cá trưởng thành chúng chủ yếu ăn mùn bã hữu cơ và thực vật phù du.Đặc biệt chúng có khả năng hấp phụ 70-80% tảo lục, tảo lam mà một số loài cá khác khó có khả năng tiêu hoá. Chu kỳ sinh sản của cá rô phi kéo dài khoảng 30-45 ngày từ khi phát dục lần đầu đến khi phát dục lần kế tiếp.', NULL, ' cá rô phi thuần từ các nước Israel, Singapore, Taiwan and Thailand.  ', NULL, NULL, NULL, NULL, NULL, NULL, 'Tepbac'),
