(2751, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Balitoridae', 'Cá Chạch Vây Bằng', 'FAM_039', 'Lepturichthys', NULL, 'GEN_1064', 'lepturichthysfimbriata', 'Lepturichthys fimbriata', '(Günther, 1888)', 'Cá Chạch', 'SPA_02764', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2752, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Balitoridae', 'Cá Chạch Vây Bằng', 'FAM_039', 'Nemacheilus', NULL, 'GEN_1293', 'nemacheilusmasyai', 'Nemacheilus masyai', 'Smith, 1933', 'cá chạch suối nam', 'SPA_02765', 'Thân thon dài, cán đuôi to, đầu cá nhỏ, nhọn, miệng nhỏ hình vòng cung, nằm phía dưới đầu, có 3 đôi râu dài, một đôi râu mõm, một đôi ở hàm trên và một đôi ở cằm, mắt trung bình, nằm sát đỉnh đầu. Vây lưng cao, khởi điểm trước khởi điểm vây bụng, vây ngực, vây bụng và vây hậu môn nhỏ, vây đuôi phân thùy sâu, thùy trên dài hơn thùy dưới.\nVẩy rất nhỏ, đường bên hoàn toàn từ trên nắp mang đến giữa gốc vây đuôi, thân nền nhạt có 12-14 sọc đứng thẫm từ lưng đến đường bên, vây lưng có một sọc hơi xiên màu đen, vây đuôi có hai sọc đứng màu thẫm và một đốm đen ở gốc vây, đường bên giữa thân có 12-14 đốm tròn đen nối nhau thành một sọc chạy dọc thân.\n\n ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
(2753, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Balitoridae', 'Cá Chạch Vây Bằng', 'FAM_039', 'Nemacheilus', NULL, 'GEN_1293', 'nemacheilusplaticeps', 'Nemacheilus platiceps', 'Kottelat, 1990', '', 'SPA_02766', 'Tia mềm vùng lưng (tổng số): 12-13; Tia mềm hậu môn: 8-8. Có khoảng 15 sọc dọc không đều, sẫm màu hơn dọc theo các cạnh và nhạt màu hơn ở giữa, môi không có rãnh, vây đuôi chia đôi với các thùy gần bằng nhau và đường bên không hoàn chỉnh kéo dài đến hậu môn  Sống ở vùng nước nông trong vắt trong các hồ nước chảy chậm với thảm thực vật trên cạn đang mục nát ở các sông suối vùng cao. Được tìm thấy trên sỏi với dòng chảy vừa phải đến nhanh', NULL, ' chỉ được biết đến ở lưu vực sông Mê Kông.', NULL, NULL, NULL, NULL, NULL, NULL, 'Fishbase'),
(2754, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Balitoridae', 'Cá Chạch Vây Bằng', 'FAM_039', 'Nemacheilus', NULL, 'GEN_1293', 'nemacheiluspulcher', 'Nemachilus pulcher', 'Nichols & Pope, 1927.', 'Cá Nác Nùn', 'SPA_02767', 'cá da trơn, không có vảy với thân hình thuôn dài và nhỏ. Cá chạch là dòng cá da trơn, không có vảy với thân hình thuôn dài và nhỏ. Cá chạch có thân hình tròn và rất dẻo, đặc điểm này giúp chúng có thể lẩn trốn khỏi kẻ thù một cách nhanh chóng. Thông thường, 1 chú cá chạch khi trưởng thành có cơ thể nặng từ vài lạng đến vài cân và có chiều dài tầm 10 – 95cm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.g'),
(2755, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Balitoridae', 'Cá Chạch Vây Bằng', 'FAM_039', 'Nemacheilus', NULL, 'GEN_1293', 'nemacheilusselangoricus', 'Nemacheilus selangoricus', 'Duncker, 1904', '', 'SPA_02768', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
