(2757, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Balitoridae', 'Cá Chạch Vây Bằng', 'FAM_039', 'Schistura', NULL, 'GEN_1790', 'schisturaalticrista', 'Schistura alticrista', 'Kottelat, 1990', 'Cá chạch suối', 'SPA_02770', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
