(2759, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Balitoridae', 'Cá Chạch Vây Bằng', 'FAM_039', 'Schistura', NULL, 'GEN_1790', 'schisturakengtungensis', 'Schistura kengtungensis', '(Fowler, 1936)', '', 'SPA_02772', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2760, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Balitoridae', 'Cá Chạch Vây Bằng', 'FAM_039', 'Schistura', NULL, 'GEN_1790', 'schisturanamboensis', 'Schistura namboensis', 'Freyhof & Serov, 2001', 'Cá Chạch suối nam', 'SPA_02773', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2761, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Balitoridae', 'Cá Chạch Vây Bằng', 'FAM_039', 'Schistura', NULL, 'GEN_1790', 'schisturapellegrini', 'Schistura pellegrini', 'Rendahl, 1944. ', 'Cá chạch suối huế ', 'SPA_02774', 'Kích thước cở lớn 10 cm. Môi dưới bị gián đoạn. Khởi điểm vây lưng trước khởi điểm vây bụng. Vây lưng có 8 tia phân nhánh. Vây đuôi 8 + 8 tia phân nhánh; lõm nông hoạc hơi lõm. Vây nhỏ, phải phóng to mới nhìn thấy. Đường bên không hoàn toàn chạy đến phần đầu của vây bụng hoạc gốc vây hậu môn. Có vảy ở phía trước vây bụng. Đầu có một đốm hoạc một vân. Có đốm đen ở gốc vây lưng. Thân có 9 - 12 sọc đen không đều và thường lớn hơn khoảng cách của các sọc đỏ.\nSinh học – sinh thái học: Sống ở vùng nước nông, nước chảy xiết, có đáy đá sỏi cát, vùng sống chủ yếu ở các suối vùng núi. Cá di cư theo mùa, ăn ấu trùng, công trùng.', NULL, 'Trên thế giới: Lào; Campuchia. Ở Việt Nam chủ yếu gặp từ Huế trở vào Nam (các tỉnh miền núi)', NULL, ' Đây là loài đặc hữu của ngã 3 Đông dương', 'nguồn gen cho khoa học.', NULL, NULL, NULL, NULL),
(2762, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Balitoridae', 'Cá Chạch Vây Bằng', 'FAM_039', 'Sewellia', NULL, 'GEN_1812', 'sewellialineolata', 'Sewellia lineolata', '(Valenciennes, 1846)', 'Cá chạch đá', 'SPA_02775', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
