(2765, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Acanthorhodeus', NULL, 'GEN_0012', 'acanthorhodeuslamus', 'Acanthorhodeus lamus', 'Nguyen & Le, 1999/208', NULL, 'SPA_02778', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2766, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Acanthorhodeus', NULL, 'GEN_0012', 'acanthorhodeuslongibarbatus', 'Acanthorhodeus longibarbatus', 'Mai, 1978', 'Cá thè be râu dài', 'SPA_02779', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2767, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Acanthorhodeus', NULL, 'GEN_0012', 'acanthorhodeusmacropteus', 'Acanthorhodeus macropteus', '(Bleeker, 1871)', NULL, 'SPA_02780', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2768, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Acanthorhodeus', NULL, 'GEN_0012', 'acanthorhodeustonkinensis', 'Acanthorhodeus tonkinensis', 'Vaillant, 1892.', 'Cá thè be nhỏ vây đỏ', 'SPA_02781', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2769, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Altigena', NULL, 'GEN_0068', 'altigenabibarbata', 'Altigena bibarbata', 'Mai, 1978', 'Cá Rầm xanh hai râu', 'SPA_02782', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2770, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Altigena', NULL, 'GEN_0068', 'altigenalemassoni', 'Altigena lemassoni', '(Pelleg rin et Chevey, 1936).', 'Cá rầm xanh', 'SPA_02783', 'Đặc điểm nhận dạng:\n\nCá cỡ trung bình, thân dài dẹp bên. Đầu hơi ngắn. Mõm nhô, mút trước tầy tròn, có kết hạch to tròn. Miệng dưới, hình vòng cung. Viền môi trên có khía tua nhỏ không rõ ràng. Viền môi dưới có mấu thịt tròn nhỏ dầy. Hàm dưới phát triển, phủ sừng mỏng nhọn. Có 2 đôi râu. Mắt tương đối lớn, chếch mé trên. Khoảng cách 2 mắt rộng. Vây lưng có khởi điểm trước khởi điểm vây bụng, viền sau lồi hoặc hơi bằng. Hậu môn sát gốc vây hậu môn. Vây đuôi phân thuỳ sâu. Vảy thân vừa phải, phần ngực nhỏ, trước vây lưng thay đổi không thành hàng. Đường bên hoàn toàn ở giữa thân. Thân màu xám, bụng hồng nhạt, các vây xám nhạt.\n\nSinh học, sinh thái:\n\nCá sống ở đáy và kề đáy, nơi nước trong chảy, đáy nhiều sỏi đá và rong rêu ở trung và thượng nguồn các sông. Cá xuất hiện nhiều vào mùa đông (mùa cá đẻ), còn các mùa khác ít. Cá có cỡ lớn nhất là 6 - 7kg, thường thấy 1 - 2kg. Cá lớn nhanh trong 2 năm đầu: 1 tuổi dài 30,5cm, 2 tuổi dài 42cm, 3 tuổi dài 49cm và 4 tuổi dài 56cm. Thức ăn chủ yếu là các loài tảo bám đáy, mùn bã hữu cơ và một số động vật không xương sống cỡ nhỏ. Cá thành thục vào năm thứ 2 với chiều dài 38,5 cm. Mùa sinh sản từ tháng 12 đến tháng 2 năm sau. Cá nặng 2100 kg chứa 37000 trứng. Bãi đẻ là nơi nước chảy xiết, đáy nhiều sỏi đá. Khi đẻ cá thường tập trung thành đàn lớn, vào ban đêm khi nhiệt độ thấp.', NULL, 'Trong nước: Lào Cai, Yên Bái (sông Thao, sông Chảy), Hà Giang, Tuyên Quang, Phú Thọ (sông Lô - Gâm), Cao Bằng, Lạng Sơn (sông Kỳ Cùng, sông Bằng Giang), Thái Nguyên (sông Cầu), Lai Châu, Sơn La, Hoà Bình (sông Đà), Thanh Hoá (sông Mã), Nghệ An (sông Lam), Quảng Nam (sông Thu Bồn) và Quảng Ngãi (sông Trà Khúc).\n\nThế giới: Trung Quốc (Vân Nam).', NULL, NULL, 'Cá có giá trị nghiên cứu khoa học và có triển vọng trở thành cá nuôi.', 'VU', NULL, NULL, 'vncreatures.'),
