(2772, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Amblypharyngodon', NULL, 'GEN_0075', 'amblypharyngodonchulabhornae', 'Amblypharyngodon chulabhornae', 'Vidthayanon & Kottelat, 1990', NULL, 'SPA_02785', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2773, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Amblyrhynchichthys', NULL, 'GEN_0077', 'amblyrhynchichthystruncatus', 'Amblyrhynchichthys truncatus', '(Bleeker, 1850)', 'Cá trao tráo', 'SPA_02786', 'mõm cùn và cụt; tia lưng đơn cuối cùng có răng ở phía sau; mí mắt mỡ', NULL, 'Châu Á: lưu vực sông Mê Kông và Chao Phraya, Bán đảo Mã Lai, Sumatra, Tây và Nam Borneo', NULL, NULL, NULL, NULL, NULL, NULL, 'https://fishbase.mnhn.fr/summary/7992'),
(2774, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Aphyocypris', NULL, 'GEN_0131', 'aphyocypriskikuchii', 'Aphyocypris kikuchii', '(Oshima, 1919)', NULL, 'SPA_02787', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2775, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Aristichthys', NULL, 'GEN_0160', 'aristichthysnobilis', 'Aristichthys nobilis', '(Richardson, 1845)', NULL, 'SPA_02788', 'Gai lưng (tổng cộng): 1 - 3; Tia mềm vùng lưng (tổng cộng): 6-7; Gai hậu môn : 1-3; Tia mềm hậu môn : 10 - 14. Thân màu trắng bạc đến màu bạc. Không có râu. Keels kéo dài từ eo đất đến hậu môn. Rìa tia lưng đơn cuối cùng không có răng cưa. Tia vây hậu môn phân nhánh 12-13,5. Khác với Hypphthalichthys nobilis ở chỗ có sống lưng sắc nhọn không vảy từ vùng ngực đến gốc hậu môn, lược mang mảnh, dài 650-820, chiều dài đầu 24-29% SL, và màu nhạt trơn, màu xám xanh ở trên, màu trắng ở dưới', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'fishbase'),
(2776, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Bangana', NULL, 'GEN_0203', 'banganaberhi', 'Bangana berhi', '(Fowler, 1937)', 'Cá Mõm trâu', 'SPA_02789', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2777, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Barbodes', NULL, 'GEN_0206', 'barbodesaltus', 'Barbodes altus', '(Gunther, 1868)', 'cá he vàng', 'SPA_02790', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2778, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Barbodes', NULL, 'GEN_0206', 'barbodesaurotaeniatus', 'Barbodes aurotaeniatus', '(Tirant, 1885)', 'Cá he vân', 'SPA_02791', 'Phân biệt với các loài khác trong chi ở chỗ có một cặp râu (mũi hàm), một đường bên hoàn chỉnh và (trong hầu hết các mẫu vật) bốn đốm đen nhỏ, thon dài theo chiều dọc ở hai bên (phía trên đầu đường bên, bên dưới vây lưng). gốc, bên dưới đầu sau của gốc vây lưng và trên cuống đuôi) và một ở mặt sau, bên dưới gốc vây lưng. Các đốm này rõ ràng hơn ở các mẫu được bảo quản so với các mẫu còn tươi', NULL, 'Châu Á: Mê Kông, Chao Phraya và các hệ thống thoát nước nhỏ ven biển của Vịnh Thái Lan.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://fishbase.mnhn.fr/summary/barbodes-aurotaeniatus'),
(2779, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Barbodes', NULL, 'GEN_0206', 'barbodesschwanefeldi', 'Barbodes schwanefeldi', '(Bleeker, 1853)', 'Cá he đỏ', 'SPA_02792', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2780, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Barbonymus', NULL, 'GEN_0207', 'barbonymusaltus', 'Barbonymus altus ', '(Günther,1868)', 'Cá He vàng', 'SPA_02793', 'Thân cao, dẹp bên. Đầu nhỏ, nhọn. Mõm ngắn. Miệng trước co duỗi được. Có 2 đôi râu, râu mép dài hơn râu mõm và tương đương với đương kính của mắt. Mắt to hơi lồi ra ngoài và hơi lệch về phía lưng của đầu, gần chót mõm hơn gần điểm cuối của nắp mang.\nPhần trán giữa hai mắt gần như cong lồi nhưng ở những cá thể nhỏ gần như phẳng. Cao thân tương đương 1/2 dài chuẩn. Lưng gù. Vảy tròn, to, phủ khắp thân.\nMặt lưng của thân và đầu màu xanh rêu, lợt dần xuống hai bên hông và bụng có màu trắng bạc. Toàn thân ánh lên màu vàng, mép sau lỗ mang, rải rác trên nắp mang có sắc tố đen. Vây ngực màu vàng, các vây khác màu đỏ son.\nChiều dài tối đa: 20cm.  ở Việt Nam gặp nhiều ở khu vực đồng bằng sông Cửu Long.', NULL, 'Lào, phía Đông ấn Độ, Campuchia, Thái Lan. ', NULL, NULL, NULL, NULL, NULL, NULL, 'tepbac.com'),
(2781, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Barbonymus', NULL, 'GEN_0207', 'barbonymusgonionotus', 'Barbonymus  gonionotus ', '(Bleeker,1849)', 'Cá Mè vinh', 'SPA_02794', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2782, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Barbonymus', NULL, 'GEN_0207', 'barbonymusschwanenfeldii', 'Barbonymus schwanenfeldii', '(Bleeker, 1854)', 'cá he nâu', 'SPA_02795', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2783, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Barilius', NULL, 'GEN_0208', 'bariliushuahinensis', 'Barilius huahinensis', 'Fowler, 1934', '', 'SPA_02796', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2784, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Capoeta', NULL, 'GEN_0308', 'capoetasemifasciolatus', 'Capoeta semifasciolatus', '(Günther, 1868)', 'Cá Sỉnh đòng đong', 'SPA_02797', 'Cá cấn có kích thước chỉ bằng ngón tay út, con to nhất cũng chỉ bằng ngón chân cái, thịt không béo, không nhiều thịt[4]. Cá thể trưởng thành của loài này có lưng uốn cong và một cặp râu ngắn trên hàm trên ở các góc của miệng, hai bên là một ánh kim màu xanh lá cây hoặc màu vàng-xanh. Bụng chúng có màu trắng, chuyển thành màu cam-đỏ ở con đực vào thời điểm giao phối. Con cái có thể được phân biệt bằng màu sắc xỉn của chúng. Loài này có thể đạt chiều dài 7 cm (2,8 in) mặc dù hầu hết đều không vượt quá 3,5 cm (1,4 in).', NULL, 'là một loài cá bản địa thuộc họ cá chép Cyprinidae ở lưu vực sông Hồng và miền Trung Việt Nam, ở phía đông nam châu Á', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/C%C3%A1_c%E1%BA%A5n'),
(2785, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Carassius', NULL, 'GEN_0311', 'carassiusauratus', 'Carassius aurantus', 'Linnaeus, 1758', 'Cá diếc', 'SPA_02798', 'Gai lưng (tổng cộng): 3-4; Tia mềm vùng lưng (tổng số): 14-20; Gai hậu môn: 2-3; Tia mềm hậu môn: 4-7; Đốt sống: 30-30. Thân mập mạp, dày, cuống đuôi dày và ngắn. Đầu không có vảy (Ref. 39167, 1998), rộng hình tam giác (Ref. 1998), khoảng cách giữa các hốc mắt rộng, mõm dài hơn đường kính mắt, hàm trên dài tới lỗ mũi sau hoặc không sát mắt ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'fishbase.'),
(2786, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Chagunius', NULL, 'GEN_0355', 'chaguniuschagunio', 'Chagunius chagunio', '(Hamilton, 1822)', '', 'SPA_02799', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2787, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Ciprinus', NULL, 'GEN_0415', 'ciprinuscarpio', 'Ciprinus carpio', 'Linnaeus, 1758', 'Các chép', 'SPA_02800', 'Thân cá hình thoi, mình dây, dẹp bên. Viền lưng cong, thuôn hơn viền bụng. Đầu cá thuôn, cân đối. Mõm tù. Có hai đôi râu: Râu mõm ngắn hơn đường kính mắt, râu góc hàm bằng hoặc lớn hơn đường kính mắt. Mắt vừa phải ở hai bên, thiên về phía trên của đầu. Khoảng cách hai mắt rộng và lồi. Miệng ở mút mõm, hướng ra phía trước, hình cung khá rộng; rạch miệng chưa tới viền trước mắt. Hàm dưới hơi dài hơn hàm trên. Môi dưới phát triển hơn môi trên. Màng mang rộng gắn liền với eo. Lược mang ngắn, thưa. Răng hầu phía trong là răng cấm, mặt nghiền có vân rãnh rõ.\n\nKhởi điểm của vây lưng sau khởi điểm vây bụng, gần mõm hơn tới gốc vây đuôi, gốc vây lưng dài, viền sau hơi lõm, tia đơn cuối là gai cứng rắn chắc và phía sau có răng cưa. Vây ngực, vây bụng và vây hậu môn ngắn chưa tới các gốc vây sau nó. Vây hậu môn viền sau lõm, tia đơn cuối hoá xương rắn chắc và phía sau có răng cưa. Hậu môn ở sát gốc vây hậu môn. Vây đuôi phân thuỳ sâu, hai thuỳ hơi tầy và tương đối bằng nhau.\n\nVẩy tròn lớn. Đường bên hoàn toàn, chạy thẳng giữa thân và cuống đuôi. Gốc vây bụng có vẩy nách nhỏ dài. Lưng xanh đen, hai bên thân phía dưới đường bên vàng xám, bụng trắng bạc. Gốc vây lưng và vây đuôi hơi đen. Vây đuôi và vây hậu môn đỏ da cam. ', NULL, 'Cá phân bố rộng trong sông ngòi, ao hồ, ruộng ở hầu hết các tính phía Bắc Việt Nam. Cá có nhiều dạng hình như: Cá chép trắng, chép cẩm, chép hồng, chép đỏ, chép lưng gù, chép thân cao, chép Bắc Kạn v.v... là loài cá có giá trị kinh tế cao. Cá chép phân bố rộng khắp các vùng trên toàn thế giới trừ Nam Mỹ, Tây Bắc Mỹ, Madagasca và châu Úc.', NULL, NULL, NULL, NULL, NULL, NULL, 'tepbac.com'),
(2788, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Cirrhinus', NULL, 'GEN_0417', 'cirrhinusjullieni', 'Cirrhinus jullieni', 'Sauvage, 1878', 'cá linh ống', 'SPA_02801', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2789, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Cirrhinus', NULL, 'GEN_0417', 'cirrhinusmicrolepis', 'Cirrhinus microlepis', 'Sauvage, 1878', 'Cá Duồng', 'SPA_02802', 'Kích thước tối đa với con đực là 65cm, trọng lượng tối đa là 5kg. Số lượng tia lưng mềm: 15 - 16, Vertebrae: 40. Phân biệt với các loài khác cùng chi trong khu vực bằng số lượng vảy đường bên 52 - 60. \n\nCá cỡ trung bình, thân hình thoi dài, mình dày, phần sau dẹp bên. Đầu khá to, ngắn và rộng. Mõm ngắn, mút mõm có nốt sần, xếp nằm ngang. Miệng ở đầu mõm, không có râu. Mắt lớn vừa nằm ở trục giữa. Môi trên hơi nhô ra, môi dưới mỏng. Màng mang phát triển. Khởi điểm vây lưng trước khởi điểm vây bụng. Vảy nhỏ phủ toàn thân, đầu không có vảy. Đường bên hoàn toàn. Thân màu vàng xám đến nâu, bụng trắng nhạt. Vây lưng và vây đuôi xám nâu, rìa đỏ. Vây ngực, vây bụng, vây hậu môn nâu xám, đỉnh vây hồng.  ', NULL, 'Các sông lớn ở Nam Bộ: hệ thống sông Đồng Nai - Sài Gòn, sông Vàm Cỏ Đông - Vàm Cỏ Tây (mùa lũ) và sông Cửu Long. Lưu vực các sông Chao Phraya và Mekong tại Campuchia, Lào, Thái Lan và Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'tepbac.com'),
(2790, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Cirrhinus', NULL, 'GEN_0417', 'cirrhinusmolitorella', 'Cirrhinus  molitorella ', '(Valenciennes, 1844)', 'Cá trôi', 'SPA_02803', 'Chiều dài tối đa được ghi nhận: 55 cm. Chiều dài thường gặp: 15.2 cm, trọng lượng tối đa được ghi nhận: 500 g.\n\nKhông có gai vây lưng. 11-15 tia vây lưng mềm. Có 34-38 đốt sống. Có 37-43 vảy trên cơ quan đường bên (bao gồm một vài vảy trên vây đuôi). Có 7-8 hàng vảy nằm giữa vây lưng và cơ quan đường bên. Điểm khác biệt của cá linh rìa so với các loài khác trong cùng giống là có ít hoặc nhiều hơn các đốm sậm màu rời rạc trên các vảy ở phần trên và giữa thân cá hoặc đôi khi nằm cả ở phần dưới thân cá. Những đốm sậm màu có thể nhìn thấy ở hầu hết các cá thể mới vừa được bắt lên hoặc các mẫu vật mới được bảo quản có thể lan rộng ra và có hình mắt lưới. Thường có một thanh màu đen nằm ngay sau vây ngưc. Số lược mang trên vòm dưới cung mang đầu tiên từ 65 – 85. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'tepbac.'),
(2791, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Cirrhinus', NULL, 'GEN_0417', 'cirrhinussp', 'Cirrhinus sp.', NULL, '', 'SPA_02804', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
