(2793, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Crossocheilus', NULL, 'GEN_0490', 'crossocheilusbenasi', 'Crossocheilus benasi', '(Pellegrin & Chevey, 1936)', NULL, 'SPA_02806', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2794, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Crossocheilus', NULL, 'GEN_0490', 'crossocheilusoblongus', 'Crossocheilus oblongus', 'Kuhl & Van Hasselt, 1823', 'cá chuồn sông', 'SPA_02807', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2795, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Crossocheilus', NULL, 'GEN_0490', 'crossocheilusreticulatus', 'Crossocheilus reticulatus', '(Fowler, 1934)', 'cá nút', 'SPA_02808', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2796, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Crossocheilus', NULL, 'GEN_0490', 'crossocheilussiamensis', 'Crosocheilus siamensis', '( Smith, 1931 )', 'Cá Chuồn sông', 'SPA_02809', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2797, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Ctenopharyngodon', NULL, 'GEN_0499', 'ctenopharyngodonidella', 'Ctenopharyngodon idella', '(Val., 1844)', 'Cá Trăm cỏ', 'SPA_02810', 'Cơ thể thon dài và vòng bụng có hình trụ nén ở phía sau, chiều dài tiêu chuẩn là 3.6 - 4.3 lần chiều cao cơ thể và gấp 3.8 - 4.4 lần chiều dài đầu, chiều dài của cuống đuôi lớn hơn chiều rộng đầu, miệng có hình vòm, hàm trên dài hơn so với hàm dưới, hàm trên kéo dài hướng về phía dưới mắt, chiều rộng miệng gấp 1.8 lần chiều dài, chiều dài miệng cách mũi, râu không xa, lược mang thưa và ngắn (từ 15 - 19), hai hàng răng trên nằm mỗi bên, chiều ngang nén lại từ 2.5 - 4.2, hàng răng bên trong khá cứng, trên bề mặt có rãnh, chiếm không gian lớn và có 39 - 46 vảy trên cơ quan đường bên, cơ quan đường bên kéo dài đến cuống đuôi, 3 - 7 tia vây lưng, vây hậu môn nằm gần hậu môn; 1 - 16 tia vây ngực; 1 - 8 tia vây bụng; 3 - 8 tia vây hậu môn; 24 tia vây đuôi. Màu sắc cơ thể: chiều ngang màu vàng lục, phần lưng màu nâu sẫm, bụng màu xám trắng. ', NULL, 'sông Hồng lưu vực sông Pearl ở miền nam Trung Quốc, sông Hắc Long Giang ở miền bắc Trung Quốc.', NULL, NULL, NULL, NULL, NULL, NULL, 'tepbac.com'),
