(2801, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Cyclocheilichthys', NULL, 'GEN_0518', 'cyclocheilichthysenoplos', 'Cyclocheilichthys  enoplos ', '(Bleeker,1849)', 'Ca Cóc sông', 'SPA_02814', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2802, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Cyclocheilichthys', NULL, 'GEN_0518', 'cyclocheilichthysfurcatus', 'Cyclocheilichthys furcatus', 'Sontirat, 1989', '', 'SPA_02815', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2803, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Cyclocheilichthys', NULL, 'GEN_0518', 'cyclocheilichthysiridescens', 'Cyclocheilichthys iridescens', 'Nichols & Pope, 1927', 'Cá Hoa', 'SPA_02816', ' Nó có chiều dài tiêu chuẩn lên tới 29,7 cm (11,7 in). [2] Con non có màu hơi vàng nhạt với 5–6 sọc sẫm màu hẹp, nhưng ở con trưởng thành (dài trên 11 cm hoặc 4,3 in) các sọc sẫm màu rộng', NULL, 'là một loài cá họ cá bản địa vùng nước ngọt ở đông nam Trung Quốc, bắc Lào và bắc Việt Nam ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Acrossocheilus_iridescens'),
(2804, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Cyclocheilichthys', NULL, 'GEN_0518', 'cyclocheilichthysrepasson', 'Cyclocheilichthys repasson', '(Bleeker, 1853)', 'cá ba kỳ', 'SPA_02817', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2805, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Cyprinus', NULL, 'GEN_0535', 'cyprinuscarpio', 'Cyprinus carpio', 'Linneaus, 1758', 'Cá Chép', 'SPA_02818', 'Thân cá hình thoi, mình dây, dẹp bên. Viền lưng cong, thuôn hơn viền bụng. Đầu cá thuôn, cân đối. Mõm tù. Có hai đôi râu: Râu mõm ngắn hơn đường kính mắt, râu góc hàm bằng hoặc lớn hơn đường kính mắt. Mắt vừa phải ở hai bên, thiên về phía trên của đầu. Khoảng cách hai mắt rộng và lồi. Miệng ở mút mõm, hướng ra phía trước, hình cung khá rộng; rạch miệng chưa tới viền trước mắt. Hàm dưới hơi dài hơn hàm trên. Môi dưới phát triển hơn môi trên. Màng mang rộng gắn liền với eo. Lược mang ngắn, thưa. Răng hầu phía trong là răng cấm, mặt nghiền có vân rãnh rõ.\n\nKhởi điểm của vây lưng sau khởi điểm vây bụng, gần mõm hơn tới gốc vây đuôi, gốc vây lưng dài, viền sau hơi lõm, tia đơn cuối là gai cứng rắn chắc và phía sau có răng cưa. Vây ngực, vây bụng và vây hậu môn ngắn chưa tới các gốc vây sau nó. Vây hậu môn viền sau lõm, tia đơn cuối hoá xương rắn chắc và phía sau có răng cưa. Hậu môn ở sát gốc vây hậu môn. Vây đuôi phân thuỳ sâu, hai thuỳ hơi tầy và tương đối bằng nhau.\n\nVẩy tròn lớn. Đường bên hoàn toàn, chạy thẳng giữa thân và cuống đuôi. Gốc vây bụng có vẩy nách nhỏ dài. Lưng xanh đen, hai bên thân phía dưới đường bên vàng xám, bụng trắng bạc. Gốc vây lưng và vây đuôi hơi đen. Vây đuôi và vây hậu môn đỏ da cam.', NULL, 'Trên thế giới: Cá chép phân bố rộng khắp các vùng trên toàn thế giới trừ Nam Mỹ, Tây Bắc Mỹ, Madagasca và châu Úc.\n\nỞ Việt Nam: Cá phân bố rộng trong sông ngòi, ao hồ, ruộng ở hầu hết các tính phía Bắc Việt Nam. Cá có nhiều dạng hình như: Cá chép trắng, chép cẩm, chép hồng, chép đỏ, chép lưng gù, chép thân cao, chép Bắc Kạn v.v... là loài cá có giá trị kinh tế cao', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2806, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Cyprinus', NULL, 'GEN_0535', 'cyprinuscentralus', 'Cyprinus centralus', 'Nguyen & Mai, 1994', 'Cá Dầy', 'SPA_02819', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2807, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Cyprinus', NULL, 'GEN_0535', 'cyprinusexophthalmus', 'Cyprinus exophthalmus', 'Mai, 1978', 'Cá Lợ con', 'SPA_02820', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2808, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Dangila', NULL, 'GEN_0547', 'dangilalineata', 'Dangila lineata', '(Sauvage,1878)', 'Cá Linh tía', 'SPA_02821', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2809, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Danio', NULL, 'GEN_0548', 'danioaequipinnulus', 'Danio aequipinnulus', '(McClelland, 1839)', 'Xảm ', 'SPA_02822', 'Loài này phát triển đến chiều dài tối đa là 4 inch (10 cm), làm cho nó một trong những loài lớn nhất của danionins. Nó được đặc trưng bởi một, cơ thể có hình như một trái ngư lôi hình màu xanh và màu vàng có vây màu xám và rõ ràng.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2810, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Danio', NULL, 'GEN_0548', 'danioalbolineatus', 'Danio albolineatus', '(Blyth, 1860)', 'cá sọc đá', 'SPA_02823', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2811, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Discherodontus', NULL, 'GEN_0590', 'discherodontusashmeadi', 'Discherodontus ashmeadi', 'Fowler, 1937', 'Cá đong', 'SPA_02824', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2812, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Distoechodon', NULL, 'GEN_0595', 'distoechodontumirostris', 'Distoechodon tumirostris', 'Peters,1881', 'Cá Nhàng', 'SPA_02825', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2813, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Elopichthys', NULL, 'GEN_0642', 'elopichthysbambusa', 'Elopichthys bambusa', '(Richardson, 1844)            ', 'Cá măng đậm', 'SPA_02826', 'Cá cỡ lớn có thể dài tới trên 100m. Thân thon dày, cán đuôi dẹp bên. Đầu lớn. Mõm nhọn dài, cứng như chiếc mỏ. Miệng lớn ở phía trước, rạch kéo dài đến quá mắt. Hàm dưới có đột nhọn nhỏ để khớp với lỗ khuyết của hàm trên. Mắt bé ở nửa trước của đầu. Không có râu. Rãnh sau môi đứt quãng ở giữa. Màng mang nối liền với eo mang. Vây lưng có khởi điểm sau khởi điểm vây bụng, gần cán đuôi hơn mút mõm. Các vây nhỏ ngắn, không chạm vào vây sau. Vây đuôi phân thuỳ sâu. Hậu môn sát gốc vây hậu môn. Vảy nhỏ và nhiều. Đường bên hoàn toàn, hơi võng thấp, phần sau ở giữa cán đuôi. Cá có màu xám, lưng sẫm hơn bụng. Vây lưng và vây đuôi xám đen. Các vây khác vàng nhạt. Cá sống ở tầng giữa và tầng trên. Tính hung hãn thường rượt bắt các loài cá khác để ăn. Cá măng là loài cá dữ thường sống đơn độc hoặc các đàn nhỏ. Thức ăn chủ yếu là các loại cá nhỏ như Cá mương, Cá thiểu, Cá ngão, Cá chát, Cá sỉnh, Cá lành canh... Mức độ ăn hại cá con của Cá măng rất lớn. Một con Cá măng nặng 10kg có thể ăn được cá trôi nặng 1,5kg. Cá bột của Cá măng nuôi chung với cá bột của các loại cá nuôi khác (mè, trôi, trắm...) có thể lớn trội hẳn lên và ăn hại rất nhiều cá bột loài khác. Cá măng có kích thước lớn, cỡ tối đa tới 50 - 60kg. Cùng nuôi trong một vực nước cá măng có thể ăn các loài cá khác gần bằng nó và lớn rất nhanh. Cá măng ở sông Hồng (1963) 1 tuổi dài 32,5cm, 2 tuổi dài 53,5cm, 3 tuổi dài 97,5cm và 4 tuổi là 135cm. Cá khai thác thường có khối lượng 1-5kg. Cá thành thục lúc 4-5 tuổi, sức sinh sản lớn, cá cái dài 97,5cm, nặng 6800g chứa 330880 trứng. Mùa sinh sản của cá từ tháng 4 - 7. Cá đẻ trứng trôi nổi. Các bãi đẻ ở vùng trung lưu các sông lớn.', NULL, 'Trong nước: Các hệ thống sông lớn ở trung du, miền núi và đồng bằng Bắc Bộ, Bắc Trung Bộ xuống tới sông Lam (Nghệ An) (Nguyễn Thái Tự, 1983). Thế giới: Từ sông Amua (Nga) qua Trung Quốc tới Bắc Việt Nam.', NULL, ' ', 'Là loài cá kinh tế nước ngọt, có kích thước rất lớn. Sản lượng trong tự nhiên trước đây khá cao. Mùa khai thác thường tập trung vào tháng 2 - 4 và 9 - 11. Cá măng không chỉ cung cấp cá thịt mà còn ăn nhiều cá nhỏ, cá tạp, đảm bảo cân băng hệ sinh thái ở sông và hồ.', 'VU', NULL, NULL, 'VnCreature'),
(2814, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Epalzeorhynchos', NULL, 'GEN_0657', 'epalzeorhynchosfrenatum', 'Epalzeorhynchos frenatum', '(Fowler, 1934)', 'Cá chuột thái', 'SPA_02827', 'Cá chuột thái (hay labeo vây đỏ) có thân hình màu xám nâu đến đen, các vây màu cam đến đỏ, cuống đuôi có 1 chấm đen lớn, vùng đầu có 1 vệt đen kéo từ miệng ra sau mắt. Đầu dài, có 2 đôi râu, miệng dưới rõ, có mấu thịt để \"nút\" chất bám. Vây lưng lớn tựa như \"Cá mập\".\nCá chuột Thái vây vàng (hay vây mắt đỏ) là cá thể bạch tạng của chuột thái, với thân màu trắng đến vàng, các vây màu cam đỏ và mắt màu đỏ hồng. ', NULL, 'Ở Việt Nam, cá phân bố số lượng ít trong các sông suối vùng Sa Bình, Easup, Lak, Dak Rlap ở Tây Nguyên (Nguyễn Thị Thu Hè, 2001; trích bởi Nguyễn Văn Hảo, 2001) Lưu vực sông Chao Phraya, Xe Bangfai và Maeklong (Thái Lan) và có thể ở lưu vực sông Mêkông (Rainboth, 1996).', NULL, NULL, NULL, NULL, NULL, NULL, 'tepbac.com'),
(2815, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Esomus', NULL, 'GEN_0675', 'esomusdanricus', 'Esomus danricus', '(Hamilton, 1822)', 'Cá Lòng tong bay', 'SPA_02828', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2816, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Esomus', NULL, 'GEN_0675', 'esomuslonggimanus', 'Esomus longgimanus', '(Lunel, 1881)', 'Cá lòng tong', 'SPA_02829', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2817, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Esomus', NULL, 'GEN_0675', 'esomusmetallicus', 'Esomus metallicus', 'Ahl, 1923', 'cá lòng tong sắt', 'SPA_02830', 'Về bề ngoài, cá có thân dài, dẹp bên, đầu nhỏ; mắt trung bình, miệng nhỏ, xiêng hướng lên trên, có hai đôi râu, râu mõm kéo dài đến sau viền mắt, râu hàm kéo dài đến quá gốc vây bụng.\nVây lưng nằm thiên về phía sau, gần như đối xứng với vây hậu môn, vây ngực dài và nhọn, vây đuôi phân thùy sâu. Vẩy trung bình phủ toàn thân, đường bên kéo dài đến gốc vây hậu môn. Thân màu nâu sáng có ánh bạc, một sọc đen đậm rộng dọc giữa thân từ mắt đến gốc vây đuôi.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Esomus_metallicus'),
(2818, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Garra', NULL, 'GEN_0737', 'garracambodgiensis', 'Garra cambodensis', '(Tirant, 1884)', 'Cá Đá rằn', 'SPA_02831', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2819, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Garra', NULL, 'GEN_0737', 'garracaudofasciata', 'Garra caudofasciata', '(Pellegrin & Chevey, 1936)', NULL, 'SPA_02832', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2820, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Garra', NULL, 'GEN_0737', 'garrafasciacauda', 'Garra fasciacauda', 'Fowler, 1937', 'cá núi sọc', 'SPA_02833', 'Có sọc ở giữa tương đối hẹp (chiều rộng khoảng 1-1,5 hàng tỷ lệ); một vây lưng trơn; một sọc đen ở dưới mép rõ rệt dọc theo mỗi thùy vây đuôi (Ref. 27732 ); chỉ với râu rostral; đĩa tinh thần nhỏ, ngắn hơn rộng', NULL, 'Châu Á: Mê Kông (Tham khảo 27732 ), lưu vực sông Chao Phraya và Maeklong (Tham khảo 26336 )', NULL, NULL, NULL, NULL, NULL, NULL, 'https://fishbase.mnhn.fr/summary/27165'),
(2821, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Garra', NULL, 'GEN_0737', 'garrafisheri', 'Garra fisheri', 'Fowler, 1937', 'Cá bám đá', 'SPA_02834', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2822, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Garra', NULL, 'GEN_0737', 'garrafuliginosa', 'Garra fuliginosa', 'Fowler, 1934', 'cá sứt mũi', 'SPA_02835', 'Mõm có mõm thứ cấp, có vòi dài gấp đôi chiều dài, hướng xuống dưới và tiếp xúc với mõm dọc theo mặt dưới của nó (Tham khảo 43281 ). Một mõm ba thùy phát triển tốt; 10 lược mang ở cung dưới của cung thứ nhất; thân sẫm màu có vảy ngẫu nhiên nhạt hơn; (Tham khảo 12693 ). Thân màu nâu sẫm với 5-6 sọc mờ và một đốm đen lớn ở cuống đuôi', NULL, 'Châu Á: Chao Phrya và Mekong (Tham khảo 12693 ), hệ thống sông Maeklong và Bán đảo Thái Lan', NULL, NULL, NULL, NULL, NULL, NULL, 'https://fishbase.mnhn.fr/summary/27167'),
(2823, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Garra', NULL, 'GEN_0737', 'garramirofrontis', 'Garra mirofrontis', 'Chu & Cui, 1987', 'Cá Bậu', 'SPA_02836', 'Chiều dài tối đa : 8,2 cm SL đực/không giới tính;', NULL, 'Châu Á: Trung Quốc.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.fishbase.se/summary/60455'),
(2824, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Garra', NULL, 'GEN_0737', 'garraobturostris', 'Garra obturostris', 'Mai, 1978', 'Cá Mỡ mõm ngắn', 'SPA_02837', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2825, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Garra', NULL, 'GEN_0737', 'garraorientalis', 'Garra orientalis', '(Nichols, 1952)            ', 'Cá sứt mũi', 'SPA_02838', 'Tia mềm vùng lưng (tổng số): 10-10; Tia mềm hậu môn: 7-7. Được chẩn đoán từ loài Garra ở thoát nước Yuanjiang ở Vân Nam bằng sự kết hợp các đặc điểm sau: hai cặp râu; có 32-35 vảy đường bên; 16 vảy tròn; răng hầu 3 hàng, 2.4.5-5.4.2; mõm tròn, có rãnh trước lỗ mũi; và hậu môn hơi ở phía trước gốc vây hậu môn, cách nhau bởi 2 vảy', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'fishbase.'),
(2826, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Gobiobotia', NULL, 'GEN_0772', 'gobiobotiakoleri', 'Gobiobotia koleri', 'Bănărescu & Nalbant, 1966', NULL, 'SPA_02839', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2827, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Hampala', NULL, 'GEN_0815', 'hampaladispar', 'Hampala dispar', 'Smith, 1934', 'Cá ngựa chấm', 'SPA_02840', 'Cá có thân dài dẹp bên, đầu cá tương đối lớn với cái mõm nhọn dài, miệng ở mút mõm, rộng ngang, rãnh miệng hơi xiên kéo dài về phía sau quá viền trước mắt, hàm trên hơi dài hơn hàm dưới. Mắt to nằm ở nửa trên của đầu. Có một đôi râu hàm, dài gần bằng đường kính mắt. Lưng nâu xám, bụng vàng nhạt ánh bạc. Một chấm đen tròn lớn ở hai bên thân, ngang trên vẩy đường bên.\nVây lưng ngắn, khởi điểm ngang với khởi điểm vây bụng, tia đơn cuối vây lưng hóa xương và phía sau không có răng cưa, vây ngực, vây bụng và vây hậu môn ngắn. Vây lưng vàng đến đỏ gạch, vây đuôi màu da cam, có dải đen nhạt ở rìa ngoài mỗi thùy, các vây khác nâu sáng đến nhạt màu.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Hampala_dispar'),
(2828, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Hampala', NULL, 'GEN_0815', 'hampalamacrolepidota', 'Hampala macrolepidota', 'Kuhl & Van Hasselt, 1823', 'cá ngựa nam', 'SPA_02841', 'Cá có các tia vây đều đỏ nhạt; có vệt đen nằm ở giữa đường bên. Cá ngựa dài khoảng 60 cm, cá ngựa cỡ 3 ngón tay, một con cỡ 300- 500gram, có con nặng hơn 1 kg. Loài cá này rất khó bắt, nếu là vó gạt thì chỉ cần động nước là nó sẽ vụt khỏi mảnh lưới. cá ngựa bay lên cao khỏi mặt nước khoảng 3-4m. Các loài cá họ chép, thậm chí cá lóc cũng phóng không hơn loài cá ngựa. cá ngựa là loài nhút nhát và tinh khôn. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2829, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Hemiculter', NULL, 'GEN_0848', 'hemiculterleucisculus', 'Hemiculter leucisculus', '(Basilewsky, 1855)            ', NULL, 'SPA_02842', 'Gai lưng (tổng cộng): 3-3; Tia mềm vùng lưng (tổng số): 7-7; Gai hậu môn: 3-3; Tia mềm hậu môn: 11-13. Đường bên hoàn chỉnh, đột ngột đi xuống ở vây ngực, tạo thành một góc, đi lên dọc theo vây hậu môn cho đến giữa vây đuôi. Màu xanh xám ở phía sau, màu trắng ở bụng', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'fishbase.se'),
