(2835, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Hypsibarbus', NULL, 'GEN_0941', 'hypsibarbuspierrei', 'Hypsibarbus pierrei', '(Sauvage, 1880)', 'Cá He phi', 'SPA_02848', 'Có 4 hàng vảy ngang giữa đường bên và hàng vảy lưng giữa ở gốc vây lưng; 5-8 lược mang ở chi dưới của vòm mang thứ nhất', NULL, 'Châu Á: Thái Lan đến Việt Nam và Malaysia', NULL, NULL, NULL, NULL, NULL, NULL, 'https://fishbase.mnhn.fr/summary/54660'),
(2836, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Hypsibarbus', NULL, 'GEN_0941', 'hypsibarbussarana', 'Hypsibarbus sarana', '(Hamilton)', 'Cá Trắng sa', 'SPA_02849', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2837, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Hypsibarbus', NULL, 'GEN_0941', 'hypsibarbusvernayi', 'Hypsibarbus vernayi', '(Norman, 1925)', '', 'SPA_02850', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2838, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Hypsibarbus', NULL, 'GEN_0941', 'hypsibarbuswetmorei', 'Hypsibarbus wetmorei', '(Smith, 1931)', 'Mè vinh giả ', 'SPA_02851', 'Thân cao hơi dẹp. Đầu nhỏ, mõm nhọn. Miệng nhỏ, kéo dài đến viền trước mắt. rãnh sau môi dưới gián đoạn ở giữa. Có 2 đôi râu, dài gần bằng đường kính mắt. Vảy to. Đường bên hơi cong về phía bụng.\n\nVây lưng có tia đơn cuối hóa xương và có răng cưa. Khởi điểm vây lưng, trước khởi điểm vây bụng. Vây đuôi phân thùy sâu. Thân vàng nâu, phần lưng thẫm hơn. Gốc vảy phần lưng có sắc tố đen. Vây bụng và vây hậu môn vàng da cam.\n\nCá sống ở các sông lớn miền Nam. Kích thước cũng nhỏ, khoảng dưới 20 cm. Giá trị kinh tế không cao.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
