(2849, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Lissochilus', NULL, 'GEN_1096', 'lissochilusannamensis', 'Lissochilus annamensis', '(Pellegrin et Chevey, 1936)', 'Cá trốc', 'SPA_02862', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2850, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Lobocheilos', NULL, 'GEN_1098', 'lobocheiloscryptopogon', 'Lobocheilos cryptopogon', '(Fowler, 1935)', 'cá trôi nam', 'SPA_02863', 'Vây lưng có viền xa màu sẫm; 5-7 sọc hẹp, rõ nét trên thân; 30-40 lược mang ở nhánh dưới của vòm mang thứ nhất; râu hàm trên bằng 1/4 đường kính mắt Sống ở vùng nước trung lưu đến độ sâu đáy trong các kênh, mương và dòng suối nhỏ ở vùng đồng bằng ngập lũ và phổ biến hơn ở các con sông lớn hơn khi các vùng nước tạm thời khô cạn. Di cư vào vùng đất ngập nước theo mùa trong mùa mưa,  nó ăn tảo, tảo và thực vật phù du. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Fishbase'),
(2851, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Lobocheilos', NULL, 'GEN_1098', 'lobocheilosmelanotaenia', 'Lobocheilos melanotaenia', '(Folwer, 1935)', 'cá mo sừng', 'SPA_02864', 'miệng tương đối hẹp, không chiếm toàn bộ chiều rộng của đầu và khoảng 1/2 chiều rộng tối đa của đầu; chỉ có những nốt sần nhỏ trên mõm ở những cá thể lớn (Ref. 27732 ). Vây lưng sẫm màu ở phía trong; 11-13 vảy trước lưng; 5+20-25 lược mang ở mặt trước của vòm mang thứ nhất Sống ở các sông lớn và vừa. Ăn các loài tảo và thực vật phù du mà nó nhặt được từ đá. Ở sông Mê Kông phía bắc Campuchia, người ta quan sát thấy các đàn của loài này tạo ra các vết xước trên đá rộng khoảng 1 cm và dài 7 hoặc 8 cm. Những vết này bắt đầu ở độ sâu khoảng 20 cm và ngày càng dày đặc hơn trên các bề mặt sâu hơn. ', NULL, '  lưu vực sông Mê Kông và Chao Phraya.', NULL, NULL, NULL, NULL, NULL, NULL, 'Fishbase'),
