(2854, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Luciosoma', NULL, 'GEN_1117', 'luciosomasetigerum', 'Luciosoma  setigerum', '(Valenciennes, 1842)', 'Cá Lòng tong seti', 'SPA_02867', 'Tia mềm vùng lưng 9; Tia mềm hậu môn  8. Các đốm trên vảy đường bên; sọc dưới mép màu đen trên mỗi thùy vây đuôi. râu phát triển tốt; không có nốt sần ở đầu mõm; tia chậu trước có sợi dài; hàng dọc các đốm tròn (thường hợp nhất thành một sọc), tiếp tục là sọc trên cuống đuôi và thùy trên của đuôi; tia đuôi giữa không màu ở dòng chính sông và các nhánh có độ dốc thấp với các khúc gỗ và lá rụng ở đáy . Được tìm thấy ở bề mặt của dòng nước chảy. Thức ăn chủ yếu là cá', NULL, ' Bán đảo Mã Lai, Đông Dương, Indonesia.', NULL, NULL, NULL, NULL, NULL, NULL, 'Fishbase'),
(2855, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Macrochirichthys', NULL, 'GEN_1137', 'macrochirichthysmacrochirus', 'Macrochirichthys  macrochirus ', '(Valenciennes, 1844)', 'Cá Rựa sông', 'SPA_02868', 'Tia mềm vùng lưng : 10; Tia mềm hậu môn : 25 - 27. Đầu hếch lên; không có râu; bụng có sống lưng sắc nhọn từ cổ họng đến hậu môn . Cơ thể bị nén mạnh; mặt lưng phẳng ngoại trừ phần gáy lõm. Miệng hướng lên trên. Vây ngực thon dài. Gốc vây đuôi có đốm đen. Hàm dưới nhô ra, đầu nhọn móc vào khe hở của hàm trên; vảy nhỏ và sắp xếp không đều Được tìm thấy ở các sông hồ lớn ở độ sâu trung bình đến nông. Cá con ăn côn trùng trong khi cá trưởng thành ăn cá. Di chuyển về phía rừng ngập khi nước dâng cao và quay trở lại sông ngay khi mực nước bắt đầu rút', NULL, ' Thái Lan tới Việt Nam và Indonesia (Tham khảo 7050 ). Được biết đến từ lưu vực sông Mê Kông và Chao Phraya', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
