(2857, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Megalobrama', NULL, 'GEN_1178', 'megalobramaterminalis', 'Megalobrama terminalis', '(Richardson, 1846)', NULL, 'SPA_02870', 'Gai lưng ( tổng cộng): 3; Tia mềm vùng lưng (tổng cộng): 7; Gai hậu môn : 3; Tia mềm hậu môn : 26. Có phần nhô lên rõ rệt ở phía sau đầu. Một chút đường cong xuống ở đường bên. Màu xám đen ở phía sau, màu trắng bạc ở bụng', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'fishbase.se'),
(2858, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Mekongina', NULL, 'GEN_1191', 'mekonginaerythrospila', 'Mekongina erythrospila', 'Fowler, 1937', 'Cá Mê kông', 'SPA_02871', 'Môi trên không được ngăn cách với mõm bằng rãnh mõm; không có đĩa thần kinh; không có râu; không có thùy mống; 10 tia vây lưng phân nhánh. Được tìm thấy trong dòng nước chảy xiết ở các con sông cỡ vừa và lớn  Sống ở vùng sâu hơn chậm hơn trong mùa khô . Thích những bãi đá trải dài với thác ghềnh và dòng chảy xiết. Ăn chất diệp lục thủy sinh và thực vật phù du khảo. Di cư theo đàn lớn, bao gồm hàng trăm loài cá, thường cùng với các loài cá chép và cá chạch khác như Hypsibarbus spp., Scaphognathops spp., Cirrhinus siamensis và Botia modesta', NULL, ' lưu vực sông Mê Kông.', NULL, NULL, NULL, NULL, NULL, NULL, 'Fishbase'),
