(2869, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Onychostoma', NULL, 'GEN_1376', 'onychostomagerlachi', 'Onychostoma gerlachi', '(Peters, 1881)            ', NULL, 'SPA_02882', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2870, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Onychostoma', NULL, 'GEN_1376', 'onychostomalaticeps', 'Onychostoma laticeps', 'Gunther, 1896            ', 'Cá sỉnh gai', 'SPA_02883', 'Vây lưng: IV, 8, vây ngực: I, 15, vây bụng II, 8, vây hậu môn: III, 5, vảy trên đường bên: 47 - 48. Cá có thân dẹt bên, thon dần về đuôi. đầu tù ngắn. Miệng dưới, không có râu. Hàm dưới phủ sừng, có sắc cạnh. Mặt lớn mằn ở hai bên đầu. Đỉnh dầu hơi lồi, nhẵn. Rãnh sau môi dưới thu hẹp ở góc miệng. Khoảng cách 2 ổ mặt rộng. Khởi điểm vây lưng ở trước khởi điểm vây bụng. Tia gai cứug vây lưng khỏe, có khía răng cưa ở mặt sau. đường bên hoàn toàn hơi võng về phá bụng. Vảy khá top sắp xếp đều. gốc vảy bụng có một vảy phụ nhỏ ngắn. Cá có lưng màu xám, bụnmgh màu da cam. Các vây màu xám. Cá sỉnh gai ăn các chất hữu cơ vụn nát và các loài tảo bám, đôi khi cũng ăn các loài động vật không xương sống cỡ nhỏ. Cá sỉnh gai thành thục sau 2 năm tuổi. Mùa cá đẻ vào tháng 12 năm trước đến tháng 2 năm sau.. Nơi cá đẻ có lẽ là các hang đá ở trung lưu các sông lớn. Cá sỉnh gai sống ở tầng giữa các sông suối lớn vùng núi. Là loại cá ưa hoạt dộng.', NULL, 'Việt Nam: Lai Châu (Phong Thổ, Thái Nguyên (Chợ Mới; Sông Cầu, Lạng Sơn (sông Kỳ Cùng, Nghệ An (sông Lam. Vùng huyện Con Cuông). Thế giới: Trung Quốc.', NULL, NULL, 'Thịt cá sỉnh gai ăn rất ngon. Cá sỉnh gai cho sản lượng khá ở các sông suối miền núi.', 'V', NULL, NULL, 'Vn Creature'),
