(2875, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Opsarius', NULL, 'GEN_1388', 'opsariuskoratensis', 'Opsarius koratensis', '(Smith, 1931)', '', 'SPA_02888', 'Có 15-18 vảy trước lưng; một sọc dọc rộng, mờ ở hai bên; 2-9 mờ (đôi khi bị thiếu), thanh dọc ngắn Được tìm thấy ở các con sông cỡ trung bình đến lớn. Được báo cáo là xảy ra trên nền sỏi ở những dòng suối nhỏ, trong, chảy xiết cho đến những đoạn sông lớn chảy xiết. Ăn ấu trùng côn trùng, đặc biệt là trichterans', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Fishbase'),
