(2877, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Osteochilus', NULL, 'GEN_1408', 'osteochilusbarbatula', 'Osteochilus barbatula', '(Sauvage,1878)', 'Cá Lúi râu', 'SPA_02890', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2878, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Osteochilus', NULL, 'GEN_1408', 'osteochiluslini', 'Osteochilus lini', 'Fowler, 1935', 'cá núi kỳ', 'SPA_02891', 'Thường có 12-13 tia vây lưng phân nhánh; khi còn sống, thân có màu lục nhạt với các vây màu hồng và một đốm sẫm màu, thon dài phía trên vây ngực', NULL, 'Châu Á: lưu vực sông Mê Kông và Chao Phraya.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://fishbase.mnhn.fr/summary/Osteochilus-lini'),
(2879, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Osteochilus', NULL, 'GEN_1408', 'osteochilusmicrocephallus', 'Osteochilus microcepalus', '(Valenciennes, 1842)', 'Cá lúi sọc', 'SPA_02892', 'Loại cá này sinh sản nhanh và sống từng đàn, nhưng con lớn nhất cũng thường chỉ bằng độ hai ngón tay, nhỏ thì bằng ngón tay cái, vảy cũng đều sáng bóng. Cá lúi mẹ to đến hai ba ngón tay, con nào cũng mập, mỡ nhiều, bụng đầy trứng. Cá lúi ở suối là mập, xương mềm, thịt thơm, ngọt và xương có vị chát.', NULL, 'Cá lúi sọc phân bố rộng trong khu vực Đông Nam Á, từ hạ lưu sông Mê Kông (Campuchia (Tonle Sap và các chi lưu của sông Mê Kông, bao gồm cả sông Sêrêpôk), Lào (từ thác Khone về phía nam), Thái Lan và Việt Nam) tới lưu vực Salween, Mae Klong và Chao Praya ở Thái Lan (Vidthayanon et al. 1997)[2], tới Indonesia (Sumatra và Kalimantan), Malaysia (Sarawak và Malaysia bán đảo) và Brunei Darussalam', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/C%C3%A1_l%C3%BAi_s%E1%BB%8Dc'),
(2880, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Osteochilus', NULL, 'GEN_1408', 'osteochilusprosemion', 'Osteochilus prosemion', 'Foweler 1934', 'Cá Lúi', 'SPA_02893', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2881, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Osteochilus', NULL, 'GEN_1408', 'osteochilussalsburyi', 'Osteochilus salsburi', 'Nichols & Pope, 1927', 'Cá dầm đất', 'SPA_02894', 'Cá có các tia lưng phân nhánh, vây đuôi có màu xám. Chiều dài cơ thể tối đa là 19.9 cm và có thể đạt tới 97.10g', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.'),
(2882, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Osteochilus', NULL, 'GEN_1408', 'osteochilusvittatus', 'Osteochilus vittatus', '(Valenciennes, 1842)', 'cá lúi sọc', 'SPA_02895', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2883, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Osteochilus', NULL, 'GEN_1408', 'osteochiluswaandersi', 'Osteochilus waandersi', '(Bleeker, 1853)', '', 'SPA_02896', 'Thân thon dài, dẹp bên; đầu nhỏ, ngắn; mõm tù, mút mõm nhô lên và có 3 nốt sừng (một nốt lớn ở giữa và 2 nốt nhỏ hai bên); miệng kề dưới, nhỏ, hẹp ngang; rạch miệng xiên, ngắn; môi trên có một hàng gai thịt mịn, phần giữa của môi có nhiều gai thịt mịn. Có 2 đôi râu, râu mõm ngắn hơn râu hàm; mắt nhỏ. Vây lưng có khởi điểm trước khởi điểm vây bụng, tia đơn vây bụng và vây hậu môn không hóa xương; vây đuôi phân thùy sâu. Vẩy tròn to phủ khắp thân; đầu không phủ vẩy; đường bên hoàn toàn, chạy thẳng từ mép bên lỗ mang đến điểm giữa gốc vây đuôi. Thân xám, lưng thẫm, bụng trắng, giữa thân có một sọc đen chạy theo trục thân từ mõm đến ngọn các tia vây đuôi; vây lưng, vây bụng, vây hậu môn và vây đuôi có sắc tố đen thành những mảng lớn; vây ngực trắng đục. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'dongnaireserve'),
(2884, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Oxygaster', NULL, 'GEN_1415', 'oxygasteranomalura', 'Oxygaster anomalura', 'van Hasselt, 1823', 'Cá lá tre', 'SPA_02897', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
