(2887, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Paralaubuca', NULL, 'GEN_1451', 'paralaubucabarroni', 'Paralaubuca barroni', '(Fowler, 1934)', 'Cá thiểu mại', 'SPA_02900', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
