(2889, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Paralaubuca', NULL, 'GEN_1451', 'paralaubucariveroi', 'Paralaubuca riveroi', '(Fowler, 1935)', '', 'SPA_02902', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2890, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Pararhodeus', NULL, 'GEN_1459', 'pararhodeusphilanthropus', 'Pararhodeus philanthropus', NULL, NULL, 'SPA_02903', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2891, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Parazacco', NULL, 'GEN_1468', 'parazaccofasciatus', 'Parazacco fasciatus', 'Koller, 1927', 'Cá Lá giang', 'SPA_02904', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2892, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Parazacco', NULL, 'GEN_1468', 'parazaccomacracanthus', 'Parazacco macracanthus', '(Pellegrin & Chevey, 1946)', 'Cá Cấy', 'SPA_02905', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2893, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Parazacco', NULL, 'GEN_1468', 'parazaccovuquangensis', 'Parazacco vuquangensis', 'Nguyen, 1995.', 'Cá lá giang', 'SPA_02906', 'Đặc điểm nhận dạng:\n\nCá cỡ nhỏ, chiều dài tiêu chuẩn dài gấp hơn 3 lần chiều cao thân, gấp 4 lần chiều cao đầu. Chiều dài đầu gấp 4 lần đường kính mắt, gấp 2,5 lần chiều dài mõm. Dài mõm bé hơn dài sau ổ mắt. Hàm dưới có đột nhọn khớp với hố khuyết của hàm trên. Khởi điểm vây lưng sau khởi điểm vây bụng, từ đó tới mút mõm ngắn hơn tới mút cuống đuôi. Vây ngực dài vượt quá khởi điểm vây bụng. Những tia đầu của vây hậu môn rất dài. Vây đuôi hai thuỳ, thuỳ dưới dài hơn thuỳ trên. Đầu và thân cá nâu đậm. Có một sọc đen từ cán đuôi và nhạt dần đến sau mắt.\n\nSinh học, sinh thái:\n\nCá lá giang có hiện tượng khoác áo cưới vào mùa sinh sản. Hai bên má và cằm có nhiều nốt sần hình chấm sao trắng. Cá đực có màu cánh sen ở dưới cằm, bụng và các vây ngực, vây bụng, vây hậu môn và vây lưng. Tỷ lệ đực cái là 1/1.\n\n', NULL, 'Trong nước: Hà Tĩnh (Hương Sơn, Hương Khê).\n\nThế giới: Loài đặc hữu, chỉ có ở Việt Nam.', NULL, NULL, 'Có ý nghĩa kinh tế nhất định với nhân dân địa phương.', 'VU', NULL, NULL, 'vncreatures.'),
(2894, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Poropuntius', NULL, 'GEN_1614', 'poropuntiusdeauratus', 'Poropuntius deauratus', '(Valenciennes, 1842)', 'cá hồng nhau bầu', 'SPA_02907', 'Thân cá dài, dẹp bên, thân màu sáng, lưng thẫm hơn bụng, vẩy phần lưng ở gốc có chấm nâu; chúng có chiếc mõm tù, nhô ra phía trước, có nhiều nốt sừng, miệng nhỏ, hàm dưới hơi thụt vào, có hai đôi râu dài gần bằng đường kính mắt, mắt to nằm ở nửa trên của đầu. Vây lưng có khởi điểm tương xứng với vây bụng, tia đơn cuôi hóa xương và phía sau có răng cưa mịn. Vẩy to phủ toàn thân, đường bên hơi cong về phía bụng, các vây xám nhạt, viền thùy vây đuôi có sọc đen. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
(2895, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Poropuntius', NULL, 'GEN_1614', 'poropuntiuskontumensis', 'Poropuntius kontumensis', '(Chevey, 1934)', '  ', 'SPA_02908', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2896, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Probarbus', NULL, 'GEN_1629', 'probarbusjullieni', 'Probarbus jullieni', 'Sauvage, 1880', 'Cá Trà sóc, Sọc dưa', 'SPA_02909', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2897, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Pseudohelanbuca', NULL, 'GEN_1655', 'pseudohelanbucasinensis', 'Pseudohelanbuca sinensis', 'Bleeker, 1864', 'Cá thiên hô sông', 'SPA_02910', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2898, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Pseudohemiculter', NULL, 'GEN_1656', 'pseudohemiculterdispar', 'Pseudohemiculter dispar', '(Peters, 1881)', 'Cá Dầu sông thân mỏng', 'SPA_02911', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2899, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Pseudoperilampus', NULL, 'GEN_1662', 'pseudoperilampushainamensis', 'Pseudoperilampus hainamensis', NULL, NULL, 'SPA_02912', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2900, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Puntioplites', NULL, 'GEN_1689', 'puntioplitesfalcifer', 'Puntioplites falcifer', 'Smith, 1929', 'Cá Dảnh vây lưng cao', 'SPA_02913', 'Thân ngắn, cao, dẹp bên. Vảy tròn, lớn vừa, phủ khắp thân, có hai hàng vảy phủ lên gốc vây lưng và vây hậu môn, gốc vây đuôi có 4 hàng. Vảy nách gốc vây bụng có hình mũi mác và dài hơn gốc vây bụng. Đường bên hoàn toàn, phần sau của đường bên nằm trên trục giữa thân.\nKhởi điểm vây lưng sau khởi điểm vây bụng, ngang với vảy đường bên thứ 9 - 10, gần điểm giữa vây đuôi hơn chót mõm, tia đơn cuối cùng hóa xương cứng và mặt sau có răng cưa. Vây đuôi chẻ 2 rãnh chẻ sâu hơn 1/2 chiều dài của nó. Mặt lưng của thân và đầu có màu xanh rêu, mặt bên và dưới của đầu cũng như thân có màu trắng bạc. Ngọn các vây lưng, vây hậu môn, vây đuôi có màu xám đen. Gốc vây bụng, vây lưng, trước mõm ửng lên màu vàng.\nNgoài tự nhiên cá dảnh đạt chiều dài tối đa 40cm. ', NULL, 'Việt  Nam gặp nhiều ở đồng bằng sông Cửu Long. Thái Lan, Campuchia, Lào', NULL, NULL, NULL, NULL, NULL, NULL, 'tepbac'),
(2901, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Puntioplites', NULL, 'GEN_1689', 'puntioplitesproctozystron', 'Puntioplites proctozysron', '(Bleeker, 1865)', 'cá dảnh', 'SPA_02914', 'cá có thân ngắn, cao, dẹp bên, viền lưng nhô cao, nhất là trước khởi điểm vây lưng, viền bụng cong nông, độ cong nhỏ hơn viền lưng, bụng tròn. Vẩy tròn lớn, vừa phải, phủ khắp thân; có hai hàng vẩy bao ở gốc vây lưng và vây hậu môn; có 4 hàng vẩy phủ ở gốc vây đuôi.\nPhần đầu cá cho thấy cá có đầu nhỏ, dẹp bên, mõm ngắn tù, lỗ mũi gần viền mắt hơn mút mõm, miệng kề dưới, hẹp ngang, rạch miệng xiên, mút cuối tới viền trước mắt, môi trên có rãnh sâu và liên tục, cá không có râu dù chúng thuộc họ cá chép với đặc trưng là có râu, mắt to tròn, nằm chếch phía trên. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
(2902, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Puntius', NULL, 'GEN_1690', 'puntiusbinotatus', 'Puntius binotatus', '(Valenciennes, 1842)', 'cá trắng', 'SPA_02915', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2903, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Puntius', NULL, 'GEN_1690', 'puntiusbrevis', 'Puntius brevis', '(Bleeker, 1849)', 'cá dầm', 'SPA_02916', 'Tia lưng đơn giản cuối cùng không có răng cưa dọc theo mép sau; 1 cặp râu hàm trên; một đốm đen ở cuống đuôi ; đường bên hoàn chỉnh; không có đốm đen riêng biệt ở gốc các tia vây lưng trước Bắt gặp ở vùng ngập lũ, kênh rạch, mương, suối nhỏ chảy chậm. Sinh sôi nảy nở ở các vùng đất ngập nước và sống ở những vùng có thảm thực vật thủy sinh phong phú. Ăn động vật giáp xác, giun ống, tảo và động vật phù du. Di chuyển đến vùng đất mới bị ngập trong mùa lũ và sinh sản ở đó ', NULL, '  lưu vực sông Mê Kông và Chao Phraya, Bán đảo Mã Lai và Java.', NULL, NULL, NULL, NULL, NULL, NULL, 'fishbase'),
(2904, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Puntius', NULL, 'GEN_1690', 'puntiusequalitus', 'Puntius equalitus', 'Nguyen & Le, in Eve et al.', NULL, 'SPA_02917', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2905, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Puntius', NULL, 'GEN_1690', 'puntiusleiacathus', 'Puntius leiacathus', '(Bleeker 1849).', NULL, 'SPA_02918', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2906, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Puntius', NULL, 'GEN_1690', 'puntiusorphoides', 'Puntius orphoides', '(Valenciennes, 1842)', 'cá đỏ mang', 'SPA_02919', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2907, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Puntius', NULL, 'GEN_1690', 'puntiussemifasciolatus', 'Puntius semifasciolatus', '(Günther, 1868)            ', 'Cá lòng đong chấm', 'SPA_02920', ' Màu vàng, con cái thường có đốm đen, con đực có ít đốm hoặc không có đốm nào, vây màu cam, ở con cái có tông màu đậm hơn ở con đực. Các vây của nó mềm và tròn, làm nổi bật vây đuôi thường có phần cuối hình chữ “V\", không có cằm. Nó là một loài cá chép có thân hình rộng và dẹt sang một bên. Kích thước của nó ở giai đoạn trưởng thành, con cái là 7cm. xấp xỉ và con đực là 6 cm. Chúng là loài cá ăn tạp, sẵn sàng chấp nhận các chế phẩm thương mại', NULL, ' Nó cũng được tìm thấy ở sông Mê Kông, ở vùng nước chảy xiết và ôn hòa của các con sông gần Quảng Châu và Hồng Kông. Chúng cũng đã được giới thiệu ở Singapore và Hawaii.', NULL, NULL, NULL, NULL, NULL, NULL, 'Acuario adictos'),
(2908, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Puntius', NULL, 'GEN_1690', 'puntiusspp', 'Puntius spp', NULL, '  ', 'SPA_02921', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2909, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Raiamas', NULL, 'GEN_1707', 'raiamasguttatus', 'Raiamas guttatus', '(Day, 1870)', 'Cá nhồng', 'SPA_02922', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2910, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Rasbora', NULL, 'GEN_1715', 'rasboraargyrotaenia', 'Rasbora argyrotaenia', '(Bleeker, 1849)', 'Cá Lòng tong đá', 'SPA_02923', 'Vây lưng: 2; tia vây lưng: 7. Vây hậu môn: 3; tia vây hậu môn: 5. Màu nâu ánh vàng với sự lấp lánh ánh bạc, sẫm hơn về phía lưng; vảy có mép là các đường hay điểm màu nâu. 12-13 vảy giữa gáy và lưng. Đường bên hoàn hảo tới đuôi; 9 (hiếm khi 8) hàng vảy giữa các đường bên phía trên đoạn giữa của cuống đuôi. Chiều dài tối đa 12 cm.', NULL, 'Sinh sống trong lưu vực các sông Chao Phraya, Mê Kông, Mae Klong, bán đảo Mã Lai tới Borneo, Java và Sumatra ở Indonesia. Nói chung sống ngoài sông, nhưng cũng có tại các khu đồng ruộng ngập lụt.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/C%C3%A1_l%C3%B2ng_tong_m%E1%BA%A1i'),
(2911, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Rasbora', NULL, 'GEN_1715', 'rasboraaurotaenia', 'Rasbora aurotaenia', 'Tirant, 1885', 'Cá lòng tong thấp', 'SPA_02924', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2912, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Rasbora', NULL, 'GEN_1715', 'rasboraborapetensis', 'Rasbora borapetensis', 'Smith, 1934', 'Cá lòng tong đuôi đỏ', 'SPA_02925', 'Đây là loài cá thuộc họ lòng tong, sống và đI theo đàn. Loài cá này có màu sắc và hình dạng rất giống với loài hồng mi ấn độ. Cá con giống hệt neon Vua, nhưng càng phát triển thì vệt xanh sáng mờ dần đi và thay vào đó là 1 vạch vàng, miệng thì màu đỏ được thể hiện rõ nét hơn. Những cá thể trưởng thành có vạch màu đỏ và màu đen trên vây lưng và bụng rõ nét. Cá ăn tạp: trùng chỉ, côn trùng, giáp xác đến thức ăn viên. Cá đẻ trứng dính trên giá thể mềm. Tách cá bố mẹ ra khỏi trứng sau khi đẻ. Trứng nở sau 24 – 48 giờ', NULL, 'Đồng Bằng Sông Cửu Long  Một số nước Đông Nam Á', NULL, NULL, NULL, NULL, NULL, NULL, 'tepbac'),
(2913, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Rasbora', NULL, 'GEN_1715', 'rasboracephalotaenia', 'Rasbora cephalotaenia', '(Bleeker, 1852) ', NULL, 'SPA_02926', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2914, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Rasbora', NULL, 'GEN_1715', 'rasboradaniconius', 'Rasbora daniconius', '(Hamilton, 1822).', 'Cá lòng tong ', 'SPA_02927', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2915, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Rasbora', NULL, 'GEN_1715', 'rasboraeinthovenii', 'Rasbora einthovenii', '(Bleeker, 1851)', '', 'SPA_02928', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2916, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Rasbora', NULL, 'GEN_1715', 'rasboramyersi', 'Rasbora myersi', 'Brittan 1954', 'Cá Lòng tong mại', 'SPA_02929', 'Tia vây lưng: 9. Tia vây hậu môn: 8. Có một sọc đường bên giữa màu xám sẫm, sẫm hơn về phía đuôi nhưng không kéo dài tới phần vây đuôi. Gốc vây lưng gần với mắt hơn là với gốc vây đuôi. Có 3 hàng vảy giữa đường bên và hàng giữa bụng; vây đuôi thường với mép màu đen ở phía sau.', NULL, 'Loài này sinh sống trong khu vực Đông Nam Á và Trung Quốc (tỉnh Vân Nam).', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/C%C3%A1_l%C3%B2ng_tong_l%C6%B0ng_th%E1%BA%A5p'),
(2917, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Rasbora', NULL, 'GEN_1715', 'rasborapaviana', 'Rasbora paviana', 'Tirant, 1885', 'cá lòng tong', 'SPA_02930', 'Cá có kích thước nhỏ, Mẫu cá thu được có chiều dài từ 6,7 – 8 cm và trọng lượng từ 2,7 - 3,3g. Đầu hình nón, nhọn, nhỏ, miệng trên, co duỗi được. Thân dài, dẹp bên. Vi đuôi chia làm hai thùy bằng nhau, rãnh chẻ tương đương ½ chiều dài của vi. Phân nửa trên của thân và đầu cá màu nâu và nhạt dần xuống bụng, bụng có màu trắng. Dọc theo trực giữa thân có 1 sọc đen kéo dài từ sau nắp mang điến điểm gốc vi đuôi. Vi lưng màu xám nhạt. Vi ngực, vi bụng, vi hậu môn, vi đuôi màu vàng, rìa vi đuôi có màu đen.', NULL, 'phân bố ở lục địa châu Á[1] Cá được phân bố nhiều trên lưu vực sông Mekong, sống chủ yếu ở tầng mặt, nơi vùng nước tĩnh có nhiều thủy sinh vật sinh sống.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Rasbora_paviana'),
(2918, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Rasbora', NULL, 'GEN_1715', 'rasborasteineri', 'Rasbora steineri', '(Nichols & Pope, 1927)', 'Cá Mại sọc bên', 'SPA_02931', 'Có một sọc bên hẹp (có chiều rộng nhỏ hơn 1 hàng vảy) màu sẫm từ nắp mang đến hết tia vây giữa; vây lưng không có đốm; 4 vảy 1/2 giữa đường bên và điểm gốc của vây lưng', NULL, 'Châu Á: Lào, Việt Nam và Đông Nam Trung Quốc', NULL, NULL, NULL, NULL, NULL, NULL, 'https://fishbase.mnhn.fr/summary/12206'),
(2919, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Rasbora', NULL, 'GEN_1715', 'rasborasumatrana', 'Rasbora sumatrana', '(Bleeker, 1852)', 'Cá Lòng tong vạch', 'SPA_02932', 'Đầu nhỏ, nhọn, hình nón. Miệng trên có duỗi được. Thân thon dài, dẹp bên. Vi đuôi chia làm hai thùy bằng nhau, rãnh chẻ tương đương ½ chiều dài của vi. Phân nửa trên của thân và đầu cá màu nâu và nhạt dần xuống bụng, bụng có màu trắng. Dọc theo trực giữa thân có 1 sọc đen kéo dài từ sau nắp mang điến điểm gốc vi đuôi. Các gốc vi có màu trắng.', NULL, 'Đầu nhỏ, nhọn, hình nón. Miệng trên có duỗi được. Thân thon dài, dẹp bên. Vi đuôi chia làm hai thùy bằng nhau, rãnh chẻ tương đương ½ chiều dài của vi. Phân nửa trên của thân và đầu cá màu nâu và nhạt dần xuống bụng, bụng có màu trắng. Dọc theo trực giữa thân có 1 sọc đen kéo dài từ sau nắp mang điến điểm gốc vi đuôi. Các gốc vi có màu trắng.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Rasbora_sumatrana'),
(2920, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Rasbora', NULL, 'GEN_1715', 'rasboratornieri', 'Rasbora tornieri', 'Ahl, 1922', 'cá lòng tong nâu', 'SPA_02933', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2921, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Rasbora', NULL, 'GEN_1715', 'rasboratrilineata', 'Rasbora trilineata', 'Steindachner, 1870', 'cá lòng tong sọc', 'SPA_02934', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2922, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Rasbora', NULL, 'GEN_1715', 'rasboraurophthalmoides', 'Rasbora urophthalmoides', '(Kottelat, 1991)', 'Cá trâm', 'SPA_02935', 'đây là loài cá rất nhỏ (bé chỉ bằng đầu cây tăm nhang). Kích thước của chúng khoảng cỡ 16 mm, Cá thể hoang dã không đạt quá 13 mm nhưng có thể lớn hơn trong môi trường nuôi dưỡng, chúng đặc trưng bởi màu nâu cam với vạch đen dọc thân và những đốm nhỏ ở gốc vây hậu môn và đuôi. Vạch sẫm màu ở cạnh vây lưng điểm xuyết bởi viền cam và vàng tươi.\nVây lưng và vây hậu môn có những mảng sẫm mầu ở cạnh trước. Vây lưng và vây hậu môn ở cá đực cũng thể hiện màu đỏ nhạt hay cam. Cá trâm Boraras urophthalmoides là loài nhỏ nhất phổ biến trên thị trường cá cảnh. Boraras urophthalmoides rất giống với cá trâm ớt Boraras brigittae nhưng nhỏ con hơn và ngả nhiều sang tông cam.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Boraras_urophthalmoides'),
(2923, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Rasborinus', NULL, 'GEN_1716', 'rasborinusalbus', 'Rasborinus albus', 'Tu, 2003', NULL, 'SPA_02936', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2924, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Rasborinus', NULL, 'GEN_1716', 'rasborinuslineatus', 'Rasborinus lineatus', '(Pellegrin, 1907)            ', NULL, 'SPA_02937', 'Vây lưng iii-7; vây hậu môn iii-15-18; vây ngực i-14-16; vây bụng ii-7. Vảy đường bên 38-40 xung quanh vảy đuôi 14. Răng hầu 3 hàng, 2 · 4 · 5—4.4.2. Mẻ mang 12-14 bên ngoài vòm mang thứ nhất. Cột sống 4 + 31. Chiều dài cơ thể gấp 2,9 đến 3,8 lần chiều cao của thân, 3,9 đến 4,6 lần chiều dài của đầu, 6,8 đến 8,8 lần chiều dài của đuôi, 8,4 đến 9,6 lần chiều cao của đuôi và chiều dài của đầu dài gấp 3,5 đến 4,1 lần chiều dài của mõm. 3,3 đến 3,1 lần đường kính mắt, 2,3 đến 2,8 lần khoảng cách giữa hai mắt, 1,7 đến 2,2 lần chiều dài của cuống đuôi và 2,0 đến 2,4 lần chiều cao của cuống đuôi. Chiều dài của tay cầm đuôi gấp 1,0 đến 1,5 lần chiều cao của tay cầm phía sau. Thân dẹp bên, hơi cao, lưng và bụng hình vòng cung, bụng tròn, từ gốc vây bụng đến hậu môn có gờ bụng. Đầu ngắn, phẳng ở một bên và chiều dài của đầu nhỏ hơn chiều cao của cơ thể. Mõm ngắn và cùn, mõm dài bằng đường kính mắt. Đầu cuối miệng, khe hở xiên. Hàm trên và hàm dưới có chiều dài xấp xỉ bằng nhau và phần cuối của hàm trên không chạm đến mép trước của mắt. Đôi mắt có kích thước trung bình, và khoảng cách từ mép sau của mắt đến đầu mõm xấp xỉ bằng chiều dài của đầu sau mắt. Mắt to và hơi lồi, khoảng cách giữa hai mắt lớn hơn đường kính mắt bằng 11,2 - 11,7 lần đường kính mắt. Mang mở rộng, màng mắt nối với eo đất, eo đất hẹp. Vảy có kích thước vừa và lớn, và kích thước ngực nhỏ hơn một bên của cơ thể. Đường bên hoàn chỉnh, hình vòng cung, chạy ở nửa dưới của thân, dài tới giữa cuống đuôi. Vây lưng nằm sau phần trên của vây bụng, không có gai, mép ngoài bằng phẳng, khoảng cách từ gốc đến gốc của vây đuôi bằng khoảng cách từ mép sau hoặc giữa mắt. . Mép ngoài của vây hậu môn phẳng, nằm sau vây lưng và gốc gần gốc vây bụng hơn gốc vây đuôi. Các vây ngực hơi tròn, chiều dài của chúng ngắn hơn so với đầu và các đầu cuối gần như xa gốc của vây bụng. Vây bụng nằm phía trước gốc vây lưng, phần cuối cùn và không thông đến hậu môn. Vây đuôi chẻ, và thùy dưới dài hơn một chút so với thùy trên. Lưới mang ngắn và sắp xếp thưa thớt. Xương hầu họng rộng và hình vòm cung. Răng hầu nhọn và có móc. Bòng bơi có 2 khoang, khoang sau dài hơn khoang trước, dài gấp 1,8 lần khoang trước, tận cùng cụt. Ruột cong ra sau, ruột dài hơn thân. Phúc mạc có màu đen xám. Phần lưng màu đen xám, phần bụng màu nhạt, có những chấm đen nhỏ ở điểm giữa của gốc vảy ở bên thân tạo thành nhiều đường vân dọc mảnh. Vây có màu nhạt.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.'),
(2925, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Rhodeus', NULL, 'GEN_1736', 'rhodeusocellatus', 'Rhodeus ocellatus', '(Kner, 1866)            ', NULL, 'SPA_02938', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2926, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Sarcocheilichthys', NULL, 'GEN_1772', 'sarcocheilichthysnigripinnis', 'Sarcocheilichthys nigripinnis', '(Günther, 1873)', 'Cá nhọ chảo', 'SPA_02939', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2927, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Saurogobio', NULL, 'GEN_1780', 'saurogobiodabryi', 'Saurogobio dabryi', 'Bleeker, 1871. ', 'Cá đục đanh', 'SPA_02940', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2928, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Scaphognathops', NULL, 'GEN_1784', 'scaphognathopsbandanensis', 'Scaphognathops bandanensis', 'Boonyaratpalin & Srirungroj, 1971', 'Cá Dảnh giả vàng', 'SPA_02941', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2929, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Scaphognathops', NULL, 'GEN_1784', 'scaphognathopsstejnegeri', 'Scaphognathops stejnegeri', '(Smith, 1931)', 'cá dảnh giả', 'SPA_02942', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2930, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Spinibarbichthys', NULL, 'GEN_1847', 'spinibarbichthysdenticulatus', 'Spinibarbichthys denticulatus', 'Oshima, 1926.', 'Cá bỗng (giống ở Cẩm Lương, TH)', 'SPA_02943', 'Thân thấp, dẹp bên. Đầu tương đối dài. Đỉnh đầu hơi lồi. Miệng dưới hình móng ngựa. Có hai đôi râu to dài. Râu hàm dài bằng 1,5 - 1,8 lần đường kính mắt. Rãnh sau môi dưới nông. Mắt tương đối lớn, nằm ở hai bên. Khoảng cách trước ổ mắt nhỏ hơn khoảng cách sau ổ mắt. Khoảng cách hai ổ mắt rộng. Khởi điểm vây lưng ở ngang hay hơi sau một ít khởi điểm vây bụng. Trước gốc vây lưng có một gai nhọn ngược, mọc dọc theo lưng. Tia gai cứng cuối cùng của vây lưng hoá cốt khoẻ, có răng cưa mặt sau. Vây đuôi chẻ sâu. Lỗ hậu môn ở sát gốc vây hậu môn. Đường bên hoàn toàn, hơi cong về phía bụng, vảy tương đối lớn sắp xếp đều. Bụng phủ vảy. Có vảy phụ vây bụng. Lưng màu xám, nhạt dần về phía bụng. Bụng hơi vàng, các vây màu xám, hai má hơi hồng. ', NULL, 'ở Việt Nam phân bố ở  miền Bắc, sông Thu Bồn, Trà Khúc thuộc Nam Trung Bộ, sông Hồng, Yên Bái, sông Lô, Bắc Quang (Hà Giang), sông Lam - Con Cuông, Cửa Rào (Nghệ An). Trung và thượng lưu sông, nơi nước chảy xiết ở Hoa Nam, đảo Hải Nam Trung Quốc', NULL, NULL, NULL, NULL, NULL, NULL, 'Tepbac'),
(2931, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Spinibarbus', NULL, 'GEN_1848', 'spinibarbuscaldwelli', 'Spinibarbus caldwelli', '(Nichols, 1925)            ', 'Cá chày đất', 'SPA_02944', 'Vây lưng: III, 9, vây ngực: I, 15 – 16, vây bụng II, 8, vây hậu môn: III, 5, vây trên đường bên: 23 – 27. Cá có thân dày và thon dài. Đầu tương đối dài. Miệng dưới hình móng ngựa. Có 2 đôi râu to dài. Viềnmôi trên tròn. Mắt vừa phải. Đỉnh đầu lồi hơi nhẵn. Khởi điểm vây lưng trườc khởi điểm vây bụng. Trước gốc vây lưng có một gai mọc ngược nằm sát lưng. Vây lưng không có tia gai cứug. Lỗ hậu môn ở sát gốc vây hậu môn. Đường kính bên hoàn toàn, hơi cong về phía bụnmg. Vảy lớn sắp xếp đều đặn, bụng tròn phủ vảy. gốc vây bụng có một vảy phụ. Cá có lưng màu xám đen, bụng trắng. Viền ngoài vây lưng có một dải sắc tố đen rất đặc biệt. Vây ngực, vây bụng, vây hậu môn đều có màu hồng. Cá ăn tạp. Thức ăn lá các động vật không xương sống ở nước, cá con, thực vật thượng đẳng. Cá cỡ trung bình, cá thành thục sau 2 năm tuổi. Mùa đẻ vào tháng 12 năm trước vào tah1ng 2 năm sau. Bãi đẻ là nơi nước chảy mạnh, đáy có cát sỏi. Cá sống ở trung lưu các sông lớn, nơi ở là các khúc sông nước chảy vừa. Cá sống ở tầng giữa.', NULL, 'Việt Nam: Lai Châu (Phong Thổ, Yên Bái (sông Thao, Phú Thọ, (sông Bứa vùng Thanh Sơn, Hoà Bình (sông Bôi vùng Lạc Thủy, Lạng Sơn (sông Trung vùng Hữu Lũng, Nghệ An (sông Lam vùng Con Cuông) ', NULL, NULL, 'Cá chày gặp rất phổ biến ở các sông suối miền núi. Cá có sản lượng khá cao ở một số nơi. Nhân dân có kinh nghiệm dùng mật cá chày đất để chữa bệng sài nóng ở trẻ em. Thịt cá ăn rất ngon.', NULL, NULL, NULL, 'Agriviet'),
(2932, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Spinibarbus', NULL, 'GEN_1848', 'spinibarbusdenticulatus', 'Spinibarbus denticulatus', '(Oshima, 1926)', 'Cá Bỗng', 'SPA_02945', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2933, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Squalidus', NULL, 'GEN_1852', 'squaliduschankaensis', 'Squalidus chankaensis', 'Dybowski, 1872', NULL, 'SPA_02946', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2934, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Squaliobarbus', NULL, 'GEN_1853', 'squaliobarbuscurriculus', 'Squaliobarbus curriculus', '(J. Richardson, 1846)', 'Cá chày sông', 'SPA_02947', 'Thân cá dày, tương đối tròn, vẩy phủ đều toàn thân, thân và bụng có màu trắng và vàng nhạt, viền mắt màu đỏ tươi. Cá có tính ăn tạp, thiên về thực vật, mùn bã hữu cơ và có khả năng tăng trưởng trọng lượng tối đa 4 kg sau 4 năm. Ngoài tự nhiên, cá thành thục và tham gia sinh sản sau một năm tuổi, kích cỡ từ 0,2 kg trở lên. Vào mùa sinh sản (tháng 4 - 6), cá ngược dòng lên thượng lưu các con sông, suối để tham gia sinh sản và đẻ trứng trôi nổi như các loài khác (cá mè, trôi, trắm…). ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'sonnptnt.baria-vungtau.'),
(2935, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Systomus', NULL, 'GEN_1896', 'systomusbinotatus', 'Systomus binotatus', '(Valencienes, 1842)', 'Cá Trắng', 'SPA_02948', 'Cá có thân dẹp bên, đầu nhỏ, mõm nhọn, miệng trước đến cận dưới, rạch miệng xiên, góc miệng chạm tới đường thẳng đứng kẻ tứ bờ trước của mắt. Hai đôi râu phát triển, râu mõm kéo dài gần chạm mí sau của mắt, râu mép kéo dài quá mép sau của xương nắp mang, mắt lớn vừa, lệch về nửa trên của đầu.\n\nVẩy cá tròn, lớn, phủ khắp thân, đầu không có vẩy. Đường bên hoàn toàn, kéo dài từ mép trên lỗ mang đến điểm giữa gốc vây đuôi. Khởi điểm vây lưng sau khởi điểm vây bụng, tia đơn hóa xương và mặt sau tia cuối cùng có răng cưa, vây ngực kéo dài chạm gốc vây bụng; vây đuôi phân thùy sâu. Mặt lưng của đầu và thân có màu xám xanh, lợt dần xuống bụng, bụng có màu trắng bạc. Tại gốc vây đuôi có một điểm đen tròn, có đốm đen mờ nằm dưới gốc vây lưng.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2936, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Systomus', NULL, 'GEN_1896', 'systomusorphoides', 'Systomus orphoides', '(Valenciennes, 1842)', 'Cá đỏ mang', 'SPA_02949', 'Chúng có thể dài đến 25 xentimét (9,8 in), thân cá tròn, sáng bạc, phần lưng thẫm ánh xanh; có một đốm đỏ trên nắp mang và một đốm đen trên gốc vây đuôi, dẹp bên, đầu nhỏ, hơi dẹp bên, mõm ngắn, miệng trước, rạch miệng xiên, gốc miệng chạm đường thẳng đứng viền trước mắt. Có hai đôi râu, râu mõm tương đương với đường kính mắt, mắt nhỏ hơi lệch về nửa trên của đầu.\n\nVây lưng có khởi điểm hơi sau khởi điểm vây bụng, tia đơn cuối hóa xương và phía sau có răng cưa mịn, tia đơn cuối vây hậu môn mềm và trơn bóng, vây đuôi phân thùy sâu, vẩy tròn to, có một hàng vẩy phủ trên gốc vây lưng, hai hàng vẩy phủ lên gốc vây hậu môn và ba hàng vẩy phủ lên gốc vây đuôi, đường bên hoàn toàn từ mép trên lỗ mang hơi cong xuống trục giữa thân và chấm dứt giữa gốc vây đuôi, vây ngực vàng da cam, các vây khác đỏ da cam, rìa trên và dưới của vây đuôi có màu đen thành sọc dài.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
