(2945, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Yaosanicus', NULL, 'GEN_2059', 'yaosanicuskyphus', 'Yaosanicus kyphus', 'Mai, 1978', NULL, 'SPA_02958', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2946, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Yaosanicus', NULL, 'GEN_2059', 'yaosanicusnormalis', 'Yaosanicus normalis', 'Nguyen, Nguyen & Le, 1999', NULL, 'SPA_02959', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2947, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Cyprinidae', 'Cá Chép', 'FAM_114', 'Zacco', NULL, 'GEN_2066', 'zaccoplatypus', 'Zacco platypus', '(Temminck & Schlegel, 1846)', 'Cá chuôi bụng tròn', 'SPA_02960', 'có màu bạc, trên thân với vảy lớn nổi bật là một dải chéo màu xanh được vẽ bằng các đường thẳng đứng nhạt hơn. Trong mùa sinh sản, đặc biệt là những con vắt sữa (con đực) dường như chỉ phát sáng và tỏa sáng. Vóc dáng hình ngư lôi của nó cho thấy nó là một kẻ bơi nhanh. Với kích thước cuối cùng lên tới 20 cm và 6 tuổi , chúng là thành viên có tuổi thọ khá cao trong gia đình, nhưng điều này đòi hỏi một khoảng thời gian băng giá , điều này khá đơn giản trong ao.  Cá rồng là loài động vật học tập lấy sức mạnh từ nhóm. Vì vậy, chúng nên được nuôi theo nhóm từ 10-20 con để chúng cảm thấy thoải mái và có thể thể hiện những hành vi điển hình của mình.  Là loài ăn tạp , Cá rồng thích ăn côn trùng đến gần , chúng săn mồi đặc biệt vào lúc hoàng hôn, nhưng chúng cũng có thể thích thú với những thức ăn sống lớn hơn và cả những mảnh thức ăn nổi cho cá ao . Vì chúng cũng ăn những đám tảo sợi mềm nên chúng là những cảnh sát y tế lý tưởng trong ao và bể cá.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2948, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'CYPRINIFORMES', 'CÁ CHÉP', 'ORD_028', 'Gyrinocheilidae', 'Cá May', 'FAM_170', 'Gyrinocheilus', NULL, 'GEN_0808', 'gyrinocheilusaymonieri', 'Gyrinocheilus aymonieri', '(Tirant, 1883)', 'cá may', 'SPA_02961', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
