(2951, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'LOBOTIFORMES', NULL, 'ORD_049', 'Datnioididae', NULL, 'FAM_117', 'Datnioides', NULL, 'GEN_0551', 'datnioidesmicrolepis', 'Datnioides microlepis', 'Bleeker, 1853', 'Cá Hường vảy mịn', 'SPA_02964', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2952, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'LOBOTIFORMES', NULL, 'ORD_049', 'Datnioididae', NULL, 'FAM_117', 'Datnioides', NULL, 'GEN_0551', 'datnioidesquadrifasciatus', 'Datnioides quadrifasciatus', '(Sevastianov, 1809)', 'Cá Hường vện ', 'SPA_02965', 'Đặc điểm nhận dạng:\nCá cỡ nhỏ, thân hơi cao, dẹp bên, mõm nhọn, miệng xiên, hàm dưới hơi nhô ra. Vảy lược nhỏ phủ toàn thân, má và nắp mang. Đường bên liên tục, phần trước cong lên, phần đuôi thẳng. Cá có màu nâu nhạt trên lưng, phần bụng màu trắng. Có 8 - 10 sọc đen trên thân. Có 1 đốm đen tròn trên nắp mang. Cá có kích thước lớn nhất dài 30cm.\nSinh học, sinh thái:\nCá sống ở các sông nước ngọt, nhiều ở vùng hạ lưu. Loài cá dữ ăn cá, tôm, cua, một số ấu trùng côn trùng.', NULL, 'Trong nước: Cá sống ở các sông Nam Bộ: Đồng Nai, Sài Gòn, Vàm Cỏ Đông, Vàm Cỏ Tây, Cửu Long.\nThế giới: Ấn Độ, Mianma, Lào, Thái Lan, Cămpuchia, Malaixia, Inđônêxia.', NULL, NULL, 'Cá có giá trị, nhưng sản lượng thấp. Có thể thuần hóa nuôi làm cá cảnh.', 'VU', NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=4&loai=1&ID=6159'),
(2953, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'LOBOTIFORMES', NULL, 'ORD_049', 'Datnioididae', NULL, 'FAM_117', 'Datnioides', NULL, 'GEN_0551', 'datnioidesundecimradiatus', 'Datnioides  undecimradiatus ', '(Roberts & Kottelat, 1994)', 'Cá Hường Mekong', 'SPA_02966', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2954, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'MASTACEMBELIFORMES', 'CÁ CHẠCH SÔNG', 'ORD_051', 'Mastacembelidae', 'Cá Chạch Sông', 'FAM_231', 'Macrognathus', NULL, 'GEN_1140', 'macrognathuscurcumcinctus', 'Macrognathus curcumcinctus', '(Hora, 1942)', 'Cá Chạch khoang', 'SPA_02967', 'Thân dài, hơi dẹp bên; đầu nhỏ, nhọn; mõm nhọn kéo dài, phía trước mõm có nếp da hoạt động được, chia thành 3 thùy, hai thùy bên có dạng ống là lỗ mũi trước; miệng dưới nhỏ, rãnh miệng ngắn; mắt nhỏ, nằm dưới da, hơi lệch về phía nửa trên của đầu; có 1 gai nhọn nằm ở trước và dưới mắt hướng về phía sau; có 2 gai nhọn ở gốc xương nắp mang, lỗ mang hẹp, lược mang rất ngắn và thưa. Vây lưng chia thành 2 phần: phần trước gốm các gai cứng rời nhau, gai cuối cùng dài và to nhất, màng da chỉ có ở gốc; phần sau là các tia mềm; vây lưng và vây hậu môn dính liền với vây đuôi; vây hậu môn có 3 gai, gai thứ 3 chìm sâu trong da.', NULL, ' Campuchia, Indonesia (Sumatra), Lào, Malaysia (Malaysia bán đảo, Sarawak), Thái Lan, Việt Nam[', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/C%C3%A1_ch%E1%BA%A1ch_khoang#:~:text=C%C3%A1%20ch%E1%BA%A1ch%20khoang%20(Danh%20ph%C3%A1p,)%2C%20thu%E1%BB%99c%20v%E1%BB%81%20chi%20Macrognathus.'),
(2955, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'MASTACEMBELIFORMES', 'CÁ CHẠCH SÔNG', 'ORD_051', 'Mastacembelidae', 'Cá Chạch Sông', 'FAM_231', 'Macrognathus', NULL, 'GEN_1140', 'macrognathussiamensis', 'Macrognathus siamensis', '(Gunther,1861)', 'cá chạch lá tre', 'SPA_02968', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2956, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'MASTACEMBELIFORMES', 'CÁ CHẠCH SÔNG', 'ORD_051', 'Mastacembelidae', 'Cá Chạch Sông', 'FAM_231', 'Macrognathus', NULL, 'GEN_1140', 'macrognathustaeniagaster', 'Macrognathus taeniagaster', '(Fowler, 1935)            ', 'Cá chạch lấu ', 'SPA_02969', 'Sống ở môi trường nước chảy và nước đứng. Thường được tìm thấy trong các ngăn chứa. Vào ban ngày, nó dành phần lớn thời gian để chôn vùi trong bùn, cát hoặc sỏi mịn. Thông thường chỉ có mõm và mắt nhô ra từ phía dưới. Xuất hiện vào ban đêm để ăn ấu trùng côn trùng đáy, động vật giáp xác và giun. Cũng bị bắt bằng lưới đẩy và lưới đặt. Được bán tươi và thường thấy trong buôn bán cá cảnh.', NULL, 'Châu Á: lưu vực sông Chao Phrya, Mê Kông và Mê Kông.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://fishbase.mnhn.fr/summary/26798'),
(2957, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'MASTACEMBELIFORMES', 'CÁ CHẠCH SÔNG', 'ORD_051', 'Mastacembelidae', 'Cá Chạch Sông', 'FAM_231', 'Mastacembelus', NULL, 'GEN_1165', 'mastacembelusarmatus', 'Mastacembelus aculcatus', '(Bloch, 1786)', 'Cá chạch gai', 'SPA_02970', 'Thân dài, phía trước hơi tròn, phía sau dẹp ngang. Đầu ngắn nhỏ, mõm nhọn dài. Phía trước đầu mõm có nếp da hoạt động được. Miệng nhỏ, góc miệng nằm xa bờ trước ổ mắt. Không có gai ở xương nắp mang trước. Mắt nằm cao ở phần trên của đầu. Màng mang không liền với eo mang.\n\nĐường bên liên tục, vảy rất nhỏ. Vây lưng gồm các gai cứng nằm rời nhau ở phía trước, phần tia mềm ở phía sau. Phần sau vây lưng và vây hậu môn không liền với vây đuôi. Vây ngực tròn, vây đuôi nhỏ và không có vây bụng. Lưng và hông có màu xám nâu, bụng trắng.\n\nRìa của tia vây lưng và vây hậu môn màu trắng. Một sọc trắng chạy dọc theo vây lưng và dọc theo gốc có từ 3 đến 6 điểm đen viền thắng. Lúc cá còn nhỏ có các chấm trắng nhỏ xếp thành hàng thẳng đứng trên thân. ', NULL, 'ở Việt Nam phân bố chủ yếu đồng bằng Nam Bộ. Rộng trong thuỷ vực nước ngọt. Thái Lan, Philipin, Malaixia, ấn Độ, Lào, Campuchia.', NULL, NULL, NULL, NULL, NULL, NULL, 'Tepbac'),
(2958, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'MASTACEMBELIFORMES', 'CÁ CHẠCH SÔNG', 'ORD_051', 'Mastacembelidae', 'Cá Chạch Sông', 'FAM_231', 'Mastacembelus', NULL, 'GEN_1165', 'mastacembelusfavus', 'Mastacembelus favus', 'Hora, 1923', 'Cá chạch bông', 'SPA_02971', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2959, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'MASTACEMBELIFORMES', 'CÁ CHẠCH SÔNG', 'ORD_051', 'Mastacembelidae', 'Cá Chạch Sông', 'FAM_231', 'Mastacembelus', NULL, 'GEN_1165', 'mastacembelustaeniagaster', 'Mastacembelus taeniagaster', '( Fowler, 1935)', 'Cá chạch rằn', 'SPA_02972', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2960, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'MUGILIFORMES', 'CÁ ĐỐI', 'ORD_053', 'Mugilidae', 'Cá Đối', 'FAM_250', 'Chelon', NULL, 'GEN_0371', 'chelonsubviridis', 'Chelon subviridis', '(Valenciennes, 1836)', 'Cá Đối đất', 'SPA_02973', 'Gai lưng ( tổng cộng): 4 - 5; Tia mềm vùng lưng (tổng số): 8-9; Gai hậu môn : 3; Tia mềm hậu môn : 9. Mặt lưng màu xanh đậm, phía trên đầu màu nâu, phía bụng màu trắng; 3-6 sọc sẫm màu không rõ dọc theo hàng vảy phía trên; vây lưng màu xám; vây đuôi màu xanh lam với viền đen (Ref. 9812 ). Vây ngực hơi vàng và có thể có một đốm xanh ở gốc vây', NULL, 'Ấn Độ Dương-Thái Bình Dương: Vịnh Ba Tư (Ref.80050) và Biển Đỏ đến Samoa, phía bắc đến Nhật Bản. Được thu thập tại Natal, Nam Phi', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.fishbase.se/summary/4819'),
(2961, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'MUGILIFORMES', 'CÁ ĐỐI', 'ORD_053', 'Mugilidae', 'Cá Đối', 'FAM_250', 'Liza', NULL, 'GEN_1097', 'lizasp', 'Liza sp.', NULL, 'Cá đối ', 'SPA_02974', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2962, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'MUGILIFORMES', 'CÁ ĐỐI', 'ORD_053', 'Mugilidae', 'Cá Đối', 'FAM_250', 'Mugil', NULL, 'GEN_1257', 'mugilcephalus', 'Mugil cephalus', '(Linnaeus, 1758)', 'Cá Đối mục', 'SPA_02975', 'Cá đối đầu dẹt trưởng thành thường ăn tảo ở nước ngọt. Kích thước tối đa Cá đối đầu dẹt có thể đạt được là khoảng 120 cm, với trọng lượng tối đa khoảng 8.000 g. Loài là euryhaline có nghĩa là cá có thể thích nghi với các mức độ khác nhau của độ mặn', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/C%C3%A1_%C4%91%E1%BB%91i_%C4%91%E1%BA%A7u_d%E1%BA%B9t'),
(2963, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'OSTEOGLOSSIFORMES', 'CÁ RỒNG', 'ORD_058', 'Notopteridae', 'Cá Thát Lát', 'FAM_260', 'Chitala', NULL, 'GEN_0383', 'chitalablanci', 'Chitala blanci', '(Aubenton, 1965)', 'Cá nàng hương', 'SPA_02976', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2964, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'OSTEOGLOSSIFORMES', 'CÁ RỒNG', 'ORD_058', 'Notopteridae', 'Cá Thát Lát', 'FAM_260', 'Chitala', NULL, 'GEN_0383', 'chitalaornata', 'Chitala ornata', '(Gray, 1831)', 'cá còm', 'SPA_02977', 'Đặc điểm nhận dạng:\nCá cỡ lớn, thân cá dài, rất dẹt bên, càng về phía bụng càng mỏng. Lưng gù với viền lưng nhô lên rất cao từ sau mắt đến vây lưng. Đầu nhỏ, nhọn, dẹt bên. Mắt nhỏ. Miệng trước rộng, rạch miệng kéo dài qua khỏi ổ mắt. Xương hàm trên phát triển. Răng nhiều và nhọn mọc trên hai xương hàm, xương khẩu cái, xương lá mía, xương lười. Toàn thân phủ vảy tròn nhỏ bằng nhau. Đường bên liên tục. Vây lưng nhỏ, nằm hơi lệch về phần sau cơ thể. Vây hậu môn dài liền với vây đuôi nhỏ.\nMặt lưng đầu và thân cá có màu xanh rêu, hai bên hông và bụng màu trắng. Có từ 5 đến 10 đốm đen tròn viền trắng xếp thành một hàng ở phần sau của thân gần gốc vây hậu môn. Số lượng đốm thay đổi tùy cá thể và ngay trên một cá thể số lượng đốm ở hai phía thân cũng có thể khác nhau. Lúc còn nhỏ cá không có đốm mà thay thế bằng 10 - 15 vạch đứng đậm.\nSinh học, sinh thái:\nSống ở sông, kênh rạch, ao, đầm. Có thể sống ở các vực nước có oxy thấp, nhờ có cơ quan hô hấp phụ. Cá ăn động vật là chính: các loài sinh vật nổi, giáp xác nhỏ, côn trùng, giun, cá con, v.v... Cá Còm có chiều dài 30 - 40 cm, khối lượng 300 - 400g đã sinh sản, tuổi thành thục ở năm thứ 3. Trứng có nhiều noãn hoàng, trứng chín có đường kính trên 2 mm. Cá đẻ nhiều đợt trong mùa sinh sản từ tháng 5 đến tháng 10, mỗi lần đẻ 300 - 1000 trứng. ở nhiệt độ 28 - 320c trứng nở sau 4 - 5 ngày đêm. Cá bột, cá con thường bám tựa vào thực vật để sống (rễ bèo lục bình, rong đuôi chó, ...)', NULL, 'Trong nước: Tây Nguyên (một số sông lớn đổ vào sông Mêkong). Đông Nam Bộ (một số khu vực thuộc sông Đồng Nai, sông Sài Gòn, sông Vàm Cỏ Đông, Vàm Cỏ Tây) và Tây Nam bộ (sông Cửu Long và các phụ lưu).\nThế giới: Ấn Độ, Mianma, Lào, Thái Lan, Cămpuchia, Malaixia, Inđônêxia.', NULL, NULL, 'Loài có kích thước lớn, có hình dạng và màu sắc đặc sắc, được nuôi làm cá cảnh là nguồn gen quý. Thịt cá ngon được ưa chuộng', 'VU', NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=4&loai=1&ID=5111'),
(2965, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'OSTEOGLOSSIFORMES', 'CÁ RỒNG', 'ORD_058', 'Notopteridae', 'Cá Thát Lát', 'FAM_260', 'Nolopterus', NULL, 'GEN_1331', 'nolopterusnolopterus', 'Nolopterus nolopterus', 'Pallas, 1769', 'Cá Thát lát', 'SPA_02978', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2966, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'OSTEOGLOSSIFORMES', 'CÁ RỒNG', 'ORD_058', 'Notopteridae', 'Cá Thát Lát', 'FAM_260', 'Notopterus', NULL, 'GEN_1337', 'notopterusnotopterus', 'Notopterus notopterus', '(Pallas, 1780)', 'Cá thát lát', 'SPA_02979', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2967, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'OSTEOGLOSSIFORMES', 'CÁ RỒNG', 'ORD_058', 'Osteoglossidae', 'Cá Mơn', 'FAM_266', 'Scleropages', NULL, 'GEN_1794', 'scleropagesformosus', 'Scleropages formosus', '(Schlegel & Muller, 1844)', 'Cá mơn, cá rồng', 'SPA_02980', 'Cá cỡ lớn, thân thon, dài, dẹp bên. Có một đôi râu mõm ngắn, mập. Miệng lớn, rạch miệng xiên, vượt quá viền sau của ổ mắt. Mắt to, tròn, nằm lệch lên phần trên của đầu. Vảy to. Đường bên bắt đầu từ phía trên sau xương nắp mang uốn xuống giữa thân và phía sau hơi lệch về phần dưới cán đuôi. Tia vây ngực dài, tia vây bụng ngắn. Vây lưng và vây hậu môn nằm ở phần sau của thân, gần vây đuôi. Vây đuôi gần tròn. Màu sắc nhìn chung có ánh kim có thể thay đổi tùy vùng. Cá con ăn các loài côn trùng sống trên mặt nước, cá trưởng thành ăn các loài cá. Trứng cá lớn, số lượng ít. Cá ấp trứng phôi trong miệng. Cá có kích thước lớn, chiều dài cá thường đạt đến 90cm và trọng lượng đến trên 7kg', NULL, 'Đồng Nai (Trung lưu sông Đồng Nai, khu vực Vườn quốc gia Cát Tiên huyện Tân Phú). Thái Lan, Cămpuchia, Malaixia, Inđônêxia.', NULL, NULL, 'Có giá trị độc đáo về mặt khoa học, loài độc nhất trong giống, họ và cũng là loài cá cảnh quý được nhiều nước ưa chuộng.', 'EN', NULL, NULL, 'vncreatures'),
(2968, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Ambassidae', 'Cá Sơn Biển', 'FAM_014', 'Pseudambassis', NULL, 'GEN_1644', 'pseudambassisnotatus', 'Pseudambassis notatus', '(Blyth, 1860)', 'Cá sơn xiêm', 'SPA_02981', 'Kích thước thường gặp 8,35 – 12,66 cm ứng với trọng lượng 16,59 – 53,92 gram.Thức ăn của cá chủ yếu là côn trùng, giáp xác và cá nhỏ.', NULL, 'Cá sống ở nước ngọt. Phân bố ở Thái Lan, Lào, Campuchia, Sumatra, Borneo và Việt Nam. Tuy nhiên loài này ở Việt Nam tương đối ít gặp.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.kiemlamangiang.gov.vn/index.php?page=front&tuychon=chitietloai&id=2091'),
(2969, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Anabantidae', 'Cá Rô', 'FAM_017', 'Anabas', NULL, 'GEN_0088', 'anabastestudineus', 'Anabas testudineus', '(Bloch, 1792)', 'cá rô đồng', 'SPA_02982', 'Cá rô có màu xanh từ xám đến nhạt, phần bụng có màu sáng hơn phần lưng, với một chấm màu thẫm ở đuôi và chấm khác ở sau mang. Các gờ của vảy và vây có màu sáng. Nắp mang cá có hình răng cưa. Chúng có một cơ quan hô hấp đặc biệt dưới mang là mang phụ, cho phép chúng có thể hấp thụ được oxy trong không khí. Chúng có răng chắc, sắc, xếp thành dãy trên hai hàm, trên hai hàm còn có răng nhỏ nhọn: hàm răng ở giữa to hơn hai bên và răng có trên xương lá mía. ', NULL, '  Trung Quốc, Việt Nam, Lào, Campuchia, Thái Lan, Miến Điện, Ấn Độ, Philippines, châu Phi và các quần đảo giữa Ấn Độ và châu Úc', NULL, NULL, NULL, NULL, NULL, NULL, 'vi.wikipedia.org'),
(2970, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Anabantidae', 'Cá Rô', 'FAM_017', 'Macropodus', NULL, 'GEN_1146', 'macropodusopercularis', 'Macropodus opercularis', '(Linnaeus, 1758)            ', 'Cá đuôi cờ', 'SPA_02983', 'Kích thước tối đa 6.7 cm nhưng có thể lớn đến 8 cm trong môi trường nuôi dưỡng. Số lượng gai vây lưng (tia cứng): 11 - 17; tia vây lưng (tia mềm): 5 - 10; gai vây hậu môn: 7 - 22; tia vây hậu môn: 9 - 15; đốt sống: 27 - 29. Đuôi hình chiếc nĩa, ở cá đực hai thuỳ đuôi kéo dài; viền ngoài gần gốc đuôi có hình răng cưa nhọn; có một chấm xanh viền đỏ nổi bật trên nắp mang; ở mẫu vật, trên thân có 7-11 sọc nổi bật và đậm màu trên nền vàng nhạt (ở cá thể sống là những sọc xanh trên nền thân màu hanh đỏ); một vạch đen kéo dài từ miệng qua mắt đến chấm xanh trên nắp mang, đầu và lưng có nhiều chấm đen, khe và viền vảy nhạt màu hơn vảy Sống ở miền nhiệt đới, trong môi trường nước ngọt, gần bề mặt, độ pH: 6.0 - 8.0; độ cứng dH: 5 - 19, nhiệt độ: 16 - 26°C. Cá đực thường hung dữ và đá nhau tranh giành lãnh thổ, nhất là trong mùa sinh sản. Chúng chọn nơi yên tĩnh để nhả bọt và dẫn dụ cá cái đến để đẻ trứng, tổ bọt thường có bán kính xấp xỉ 15 cm, số lượng trứng có thể lên đến 300, sau khi thụ tinh trứng được cá bố mẹ nhả lên tổ bọt và cá đực tiếp tục chăm sóc trứng. Trứng nở sau 1 ngày. Sau 3 ngày thì cá con bơi lội tự do được. Thức ăn của cá bột là những vi sinh vật có sẵn trong nước. Cư ngụ ở những vùng nước trũng, từ vùng bụi hoang ven bờ hay vũng nước tù ở gần sông, suối cho đến những con kênh dẫn nước bên cạnh những ruộng lúa. Ở Việt Nam, loài này còn xuất hiện ở vùng cao nguyên thượng nguồn của sông Đồng Nai. Chúng có thể sống nơi nước đục và nghèo ô-xy hoà tan (nhờ khả năng thở trực tiếp). Thức ăn bao gồm tất cả những loài động vật thuỷ sinh kích thước nhỏ kể cả cá nhỏ', NULL, 'Các tỉnh phía Bắc, trải dài từ Vinh đến Tuy Hoà (ngoại trừ lưu vực sông Hương nơi chảy ra Huế và thị trấn Đông Hà , Quảng Trị). Loài này còn xuất hiện ở thượng nguồn sông Đồng Nai (chảy qua Sài Gòn) Lào, Campuchia, Malaysia, Trung Quốc, Hồng Kông, Đài Loan, Nhật Bản, Hàn Quốc', NULL, NULL, 'Loài cá được nuôi làm cảnh, cá cờ là loài cá cảnh thứ hai sau cá vàng được nhập cảnh vào châu Âu, không có giá trị trong ngư nghiệp và chăn nuôi.', NULL, NULL, NULL, NULL),
(2971, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Belontiidae', 'Cá Sặc', 'FAM_041', 'Betta', NULL, 'GEN_0220', 'bettasplendens', 'Betta splendens', 'Regan, 1910', 'Cá Thia xiêm', 'SPA_02984', 'Đốt sống : 29 - 34. Các vạch màu đỏ trên nắp mang, Chiều dài tối đa : 6,5 cm TL đực/không giới tính; (Tham khảo 12693 ); tối đa. tuổi được báo cáo: 2,00 tuổ', NULL, 'Châu Á: lưu vực sông Mê Kông.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.fishbase.se/summary/4768'),
(2972, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Belontiidae', 'Cá Sặc', 'FAM_041', 'Betta', NULL, 'GEN_0220', 'bettataeniata', 'Betta taeniata', 'Regan, 1910            ', 'Cá Lia thia, Cá chọi ', 'SPA_02985', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2973, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Centropomidae', 'Cá Chẽm', 'FAM_065', 'Parambassis', NULL, 'GEN_1453', 'parambassisranga', 'Parambassis ranga', '(Hamilton, 1822)', '', 'SPA_02986', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2974, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Centropomidae', 'Cá Chẽm', 'FAM_065', 'Parambassis', NULL, 'GEN_1453', 'parambassissiamensis', 'Parambassis siamensis', '(Fowler, 1937)', 'Cá sơn Xiêm ', 'SPA_02987', 'Cá có kích thước nhỏ, thường đạt kích thước lớn nhất 7.5cm con đực, với chiều dài phổ biến khoảng 4 cm.\nCó một đốm đen dễ thấy ở đầu gai lưng; một đốm tối kéo dài theo chiều dọc phía sau phần trên của lỗ mang (có thể rất ít hoặc không có).', NULL, 'Cá sống ở nước ngọt ở lưu vực sông MêKông phân bố ở Thái Lan, Lào, Campuchia, Sumatra, Borneo và Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2975, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Centropomidae', 'Cá Chẽm', 'FAM_065', 'Parambassis', NULL, 'GEN_1453', 'parambassiswolfii', 'Parambassis wolfii', '(Bleeker, 1850)', 'cá sơn', 'SPA_02988', 'Thân cá cao, mình dẹp, cuốn đuôi thon dài, đầu chúng lớn vừa, mõm ngắn, miệng trên, xiên, rạch miệng kéo dài đến viền trước mắt, chúng có một hàng răng nhỏ nhọn trên mỗi hàm, mắt to tròn, nằm lệch về nữa trên của đầu, khoảng cách 2 mắt cong lồi, xương trên lộ rõ ra nhỏ hơn đường kính mắt. Chiều dài tối đa 20 cm. Toàn thân màu trắng trong, hơi ửng hồng, vây lưng, vây ngực và vây bụng có màu trăng trong. Vây lưng nhọn, gai thứ hai to và cao nhất, phía trước vây lưng có một gai cứng không cử động được, phần ngọn hướng ra phía trước. Vẩy tròn, lớn vừa, phủ khắp thân, má và nắp mang  Thức ăn của chúng là côn trùng, động vật giáp xác và cá nhỏ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
(2976, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Chanidae', 'Cá Chuối', 'FAM_072', 'Ophiocephalus', NULL, 'GEN_1378', 'ophiocephalusgachua', 'Ophiocephalus gachua', '(F. Hamilton, 1822)', 'Cá chuối suối', 'SPA_02989', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2977, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Chanidae', 'Cá Chuối', 'FAM_072', 'Ophiocephalus', NULL, 'GEN_1378', 'ophiocephalusmaculatus', 'Ophiocephalus maculatus', '(Lacépède, 1802)', 'Cá chuối', 'SPA_02990', 'Cá có cỡ trung bình, thân trụ tròn dài, phần sau dẹp bên. Đầu dài nhọn. Miệng rất lớn, rạch xiên kéo dài quá viền sau mắt. Trên hai hàm, xương lá mía và xương khẩu cái đều có răng nhỏ. Mũi nhọn dài, mỗi bên đầu có 2 lỗ mũi. Hai bên má có hệ thống lỗ nhỏ, sắp xếp theo quy luật. Mắt lớn, khoảng cách 2 mắt rộng, hơi lồi. Vây lưng và vây hậu môn rất dài và đều là tia mềm không nối liền với vây đuôi. Vây ngực tròn, vây bụng bé. Đỉnh đầu có vảy hình tấm tương đối bé. Đường bên gián đoạn. Cá màu xám nâu, xen kẽ các vạch chấm đen. Dọc thân có hai hàng chấm đen. Gốc vây lưng có 1 hàng chấm đen lớn. Đầu có 1 vạch đen gãy khúc chạy từ mắt đến gốc vây lưng. Trên các vây phần lớn chấm đen xếp thành hàng Sống ở các sông ngòi, ao hồ, đồng ruộng ngập nước, nơi có nhiều thực vật thủy sinh. Về mùa rét cá dễ bị nhiễm bệnh nấm có thể lây lan thành dịch bệnh làm chết hàng loạt. Cá có thể sống ở các vùng nước có hàm lượng oxy thấp nhờ có cơ quan hô hấp phụ. Cá chuối hoa là loài cá dữ điển hình, ăn nhiều cá con, ếch nhái, tôm cua, côn trùng và ấu trùng... Cá sinh trưởng nhanh, 1 tuổi đạt 0,5kg; 2 tuổi đạt 1,2 - 1,5kg; 3 tuổi đạt 1,8 - 2,5kg; 4 tuổi đạt 3,5 - 4kg; lớn nhất có thể đạt tới 10 - 12kg/con. Cá thành thục vào năm thứ 2. Mùa sinh sản từ tháng 5 - 10, tuỳ theo vùng có thể sớm hoặc muộn hơn. Đến mùa sinh sản cá thường sống từng đôi, làm tổ ở các vùng gần bờ ao, đầm, hồ, ruộng nước, sông ngòi. Chúng thường dọn sạch các cây cối thuỷ sinh tạo thành khoảng trống, mặt thoáng với độ rộng từ 0,4 - 0,6m2 để đẻ trứng vào đó. Trứng nổi trên mặt nước và dính lại với nhau thành đám. Cá đực và cá cái quanh quẩn gần tổ để bảo vệ trứng và chăm sóc con cái đến khi cá con tự kiếm ăn và tránh được kẻ thù. Cá đẻ thành nhiều đợt trong mùa đẻ, mỗi đợt từ 5.000 - 30.000 trứng, tuỳ theo kích thước của cá cái', NULL, 'Các tỉnh phía Bắc cho tới Thanh Hoá Trung Quốc', NULL, NULL, 'Loài cá quí, hiếm mặc dù sản lượng cá tự nhiên ở đồng bằng Bắc bộ khá cao, kể cả vùng nước lợ ven biển. Cá có triển vọng là đối tượng nuôi xuất khẩu', 'EN A1c,d', NULL, NULL, NULL),
