(2987, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Cobitidae', 'Cá Chạch', 'FAM_094', 'Botia', NULL, 'GEN_0240', 'botiasp1', 'Botia sp1.', NULL, 'Cá chạch cát đỏ đuôi', 'SPA_03000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2988, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Cobitidae', 'Cá Chạch', 'FAM_094', 'Botia', NULL, 'GEN_0240', 'botiasp2', 'Botia sp2.', NULL, 'Cá chạch cát', 'SPA_03001', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2989, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Cobitidae', 'Cá Chạch', 'FAM_094', 'Cobitis', NULL, 'GEN_0439', 'cobitisarenae', 'Cobitis arenae', '(Linnaeur, 1934)', 'Cá Chạch hoa chấm', 'SPA_03002', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2990, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Cobitidae', 'Cá Chạch', 'FAM_094', 'Cobitis', NULL, 'GEN_0439', 'cobitislutheri', 'Cobitis lutheri', 'Redahl, 1935', 'Cá Chạch hoa', 'SPA_03003', 'Sự miêu tả. Tia vây lưng iii 7 ½ (8), tia vây hậu môn iii 5 ½, tia vây ngực i 7 – 8 ½, vây bụng (V) i 5 ½ – 6 (7), tia vây đuôi i (13 ) 14 i, tổng đốt sống của 5 mẫu vật lấy từ sông Karasik 41 – 44. Đặc điểm hình thái của mẫu vật trưởng thành ở địa phương điển hình được trình bày trong Bảng 2. Thân dài, khá sâu, dẹt về phía sau. Con cái trưởng thành lớn nhất, từ sông Amur, đạt 88 mm SL (ZMMU P- 7566, P- 7572). Đầu thon dài, nén lại, mặt trên lồi; mắt to, vị trí cao cấp; đường kính mắt thường (80 – 100 % cá thể trưởng thành trong mẫu) lớn hơn 20 % chiều dài đầu; khoảng gian ổ mắt hẹp, lồi. mõm chủ yếu ngắn, tù, chiều dài ở con đực thường (80 – 100%) nhỏ hơn 42% chiều dài đầu; mẫu vật có mõm thon dài được quan sát thấy ở những con cái trưởng thành lớn. Cột sống dưới ổ mắt bị chẻ đôi, dày, hơi cong, phần lớn chạm tới giữa mắt (xem bên dưới). Miệng nhỏ, kém, có môi dày; môi dưới chia làm hai phần phát triển tốt, thùy trán dài hơn phần còn lại của phần gấp lại một chút. Ba cặp râu ngắn: râu hàm, râu hàm trên và râu hàm dưới; râu hàm dưới thường dài tới mép trước của mắt hoặc kéo dài hơn, chủ yếu ở nam giới trưởng thành (xem bên dưới). Cuống đuôi rõ ràng là ngắn hơn đầu, dẹt, có các gai thịt kém phát triển ở hai bên lưng và bụng. Vây ngực thon dài ở con đực, tia đầu tiên của nó không dài hơn những vây khác, không có dạng sợi (Hình 3). Con đực có một phiến lá tròn (lamina Canestrini) ở gốc tia vây ngực thứ hai, rộng, phân nhánh; tấm lá tròn rộng, hình rìu, mép ngoài của nó cắt ngang bởi những đường dày đặc rất ngắn (Hình 4 b); đầu tấm chạm tới đoạn thứ 2 – 5 của tia kèm theo. Khởi điểm vây bụng ở phía sau khởi điểm vây lưng. Cơ thể phủ vảy nhỏ; vảy ở gốc vây lưng tròn ít nhiều, có tiêu điểm khá lớn, hơi lệch; đường kính vùng này khoảng 61 – 65 % đường kính vảy. Tạo màu trong rượu. Màu nền màu be ở các cá thể được bảo tồn. Đầu có các đốm hoặc sọc nhỏ màu nâu sẫm ở mặt lưng và hai bên; ngoài sọc điển hình kéo dài ngang mắt từ đầu mõm đến gáy, hầu hết các mẫu vật ở trạng thái bảo quản có ba sọc phát triển tốt: sọc đầu tiên (dưới hốc mắt) bên dưới và song song với sọc ngang mắt nói trên; sọc chéo thứ hai và thứ ba trên nắp mang (Hình 4 a). Vùng sắc tố của Gambetta (Gambetta, 1934) gần như hoàn thiện; vùng đầu tiên, ở giữa lưng, biểu hiện bằng các đốm lớn màu nâu sẫm có hình dạng thay đổi, xung quanh là các đốm nhỏ màu nâu. Vùng thứ hai bao gồm các đốm lớn màu nâu, thon dài theo chiều ngang, kết hợp một phần thành một đường hoặc hoàn toàn tạo thành một vệt tương đối rộng từ đầu đến gốc vây đuôi ở con đực và một số con cái. Vùng thứ ba gồm các đốm nhỏ màu nâu sẫm; vùng thứ tư ở bên giữa cơ thể được biểu hiện bằng các đốm lớn màu nâu sẫm (lớn hơn mắt),hình vuông, tròn hoặc thon dài; số lượng của chúng thay đổi từ 8 đến 16, thường ít hơn 12 (thường ít hơn 10) (xem bên dưới). Hai đốm ở gốc vây đuôi: một đốm đen dài, sống động ở phần trên gốc vây đuôi, một đốm màu nâu sẫm hoặc đen khác có hình dạng không đều ở phần dưới gốc vây đuôi. Những cá thể chỉ có một đốm (phía trên) ở gốc vây đuôi là rất hiếm. Các mẫu C. lutheri bị mờ dần từ các mẫu được thu thập cách đây hơn 30 năm thường chỉ có một đốm ở gốc trên của vây đuôi ở lớp bề mặt sensu Saitoh & Aizawa (1987), nhưng cả hai đốm đều có thể nhìn thấy được ở lớp sâu hơn. , trong mô liên kết bao quanh gốc tia vây. Vây lưng có sắc tố màu nâu sẫm dọc theo tia vây; vây đuôi có các đốm nâu thon dài dọc theo tia vây, thường tạo thành bốn đường ngang; các đốm nhỏ màu nâu rải rác trên vây ngực, vây bụng và vây hậu môn (Hình 3). * dựa trên tám mẫu vật được kiểm tra Con cái có thân hình to hơn, mảnh mai hơn con đực. Con đực có phiến tròn ở gốc tia vây ngực thứ hai, vây ngực và vây bụng thon dài, mõm thường ngắn hơn (Bảng 2); trong mùa sinh sản, các đốm đen và vết đốm ở vùng Gambetta thứ hai và thứ tư ở con đực trưởng thành thường hợp nhất với nhau, tạo thành hai sọc đen rộng (Shedko (2001) lưu ý rằng những sọc này chia thành một loạt các đốm hoặc đốm độc lập vào cuối mùa thu, như đã được quan sát trong các mẫu vật trong bể cá). Sự biến đổi trong nội bộ và giữa các quần thể của các đặc điểm chẩn đoán. Trong số 135 mẫu được kiểm tra từ bộ sưu tập ZIN, chỉ có 6,7 % (3 con cái ở sông Amur và 6 con cái ở sông Tumen\` - Ula) không có hoặc chỉ có một sọc đen mơ hồ ở vùng dưới ổ mắt trên đầu. Tương tự, 3,0% (ba cá cái ở sông Amur và Tumen\` - Ula và một cá đực ở sông Tunguska) thiếu vị trí ở phần dưới gốc vây đuôi. Tất cả 40 mẫu vật được kiểm tra từ lưu vực hồ Khanka đều có một sọc dưới ổ mắt dễ thấy và hai đốm ở gốc vây đuôi. Trong số 17 mẫu vật trưởng thành từ địa điểm điển hình trong bộ sưu tập ZMMU, chỉ có một mẫu vật (con đực, SL 49,5 mm) không có sọc dưới ổ mắt nhìn thấy được; tất cả các mẫu vật đều có hai đốm ở gốc vây đuôi; số lượng đốm ở vùng Gambetta thứ tư dao động từ 8 đến 14, hầu hết mẫu vật (68,8 %) có ít hơn 12 đốm; gai dưới ổ mắt thường đến giữa mắt (58,8 %) hoặc kéo dài ra xa hơn (35,3 %); râu hàm dưới chạm tới mép trước của mắt hoặc kéo dài hơn ở 35,3 % người trưởng thành; một con đực (P-17837) có phiến tròn với một tấm hình chai hẹp không điển hình ở vây ngực bên phải. Chỉ có một mẫu vật trong số 20 cá thể trưởng thành hoàn toàn mờ nhạt từ sông Lyanchihe trong bộ sưu tập ZMMU có râu hàm dưới không chạm tới mép trước của mắt; trong tất cả các mẫu vật, gai dưới ổ mắt chạm đến trung tâm của mắt hoặc kéo dài hơn nữa.Chỉ có hai mẫu vật trong số 34 mẫu vật trưởng thành từ sông Tsukanovka (ZMMU P- 23900) có sọc dưới ổ mắt khó nhìn thấy được; ở hầu hết các mẫu vật (67,7 %) râu hàm dưới không chạm tới mép trước của mắt; gai dưới ổ mắt không chạm tới tâm mắt ở 50% mẫu vật; một con đực có phiến tròn với một tấm hẹp không điển hình ở vây ngực bên phải; tất cả các mẫu vật đều có hai đốm ở gốc vây đuôi; trong số 57 mẫu vật trưởng thành và con non, 47,4% có ít hơn 10 đốm ở vùng Gambetta thứ tư, tổng số đốm thay đổi từ 8 đến 16. Trong 12 mẫu vật từ sông Razdolnaya (ZMMU P- 20041), có 8 – 12 đốm được tìm thấy. được quan sát thấy ở vùng Gambetta thứ tư và các mẫu vật có ít hơn 10 đốm chiếm 48,4%. Con trưởng thành lớn (16 con đực với SL 52,5 – 58,0 mm, 20 con cái với SL 64,3 – 85,0 mm) từ sông Tygda (ZMMU P- 21545) có 7 – 12 đốm ở vùng Gambetta thứ tư, mẫu vật có 7 – 10 đốm chiếm ưu thế (72,2 %); chỉ có một con cái không có đốm ở phần dưới gốc vây đuôi; một con đực có gai dưới ổ mắt không chạm tới giữa mắt; râu hàm dưới không chạm tới mép trước của mắt được quan sát thấy ở sáu con cái; chiều dài mõm ở con cái dao động từ 37,9 đến 43,5 % chiều dài đầu (trung bình 40,9%), ở con đực từ 36,0 đến 43,8 % (trung bình 39,4%). Kiểu nhân được đặc trưng bởi tổng số nhiễm sắc thể (2 n) của 50 nhiễm sắc thể với 12 meta-, 8 submeta- và 30 submeta- và acrocentrics và NF = 70 (Bảng 1) (Vasil\`ev & Vasil\`eva, 2008 a, b). Phân bố địa lý. Cobitis lutheri xuất hiện ở hạ lưu và trung lưu sông Amur (đến Blagoveshchensk), bao gồm hệ thống sông Ussuri và hồ Khanka, các sông chảy vào vịnh Amur và Ussuri ở Primorye, và các vùng lân cận của Biển Đông / Biển Nhật Bản (ví dụ, Sông Tumannaya ở biên giới Nga / Triều Tiên) và trên các con sông ở phía bắc đảo Sakhalin (Hình 1 a). Shedko (2001) đã tìm thấy loài này ở các con sông ở trung tâm bờ biển Primorye, cụ thể là Kievka, Chernaya, Margaritovka và Rudnaya. Safronov & Safronov (2002) đã ghi nhận C. lutheri từ các con sông phía đông bắc đảo Sakhalin (từ Hồ Uspenskoye đến hệ thống thoát nước của sông Lakh), từ bờ biển phía đông Sakhalin (bao gồm sông Tym\` và sông Poronai), và từ các hố lộ thiên ở làng Gastello (phía đông nam). Sakhalin). Tuy nhiên, mô tả hình thái của loài này bởi Safronov & Safronov (2002) bao gồm các đặc điểm không có ở C. lutheri (ví dụ, “tấm hẹp” của lamina roundis và 18 tia vây đuôi phân nhánh). Tên gọi thông thường. Con chạch gai của Luther (tiếng Anh); shchipovka Ljutera [щиповка Лютера] (Nga); Ah-murjum-jool-jong-geh [ỌșäḏḵǭNj] (Hàn Quốc). Nhận xét so sánh. Alesof C. lutheri đực dễ dàng phân biệt với những con đực phân bố ở hệ thống thoát nước sông Amur, C. melanoleuca và C. choii Kim & Son, bằng hình dạng lamina roundis: C. melanoleuca có phiến hình chai hẹp, trong khi C. melanoleuca có phiến hình chai hẹp, trong khi C. lutheri .choii có phiến hình con dao rất hẹp với mép ngoài có răng cưa. Cả con đực và con cái của C. melanoleuca và C. choii đều thiếu sọc dưới ổ mắt và các sọc bổ sung trên nắp mang là đặc điểm chẩn đoán của C. lutheri.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2991, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Cobitidae', 'Cá Chạch', 'FAM_094', 'Cobitis', NULL, 'GEN_0439', 'cobitistaenia', 'Cobitis taenia dolychorhychus', 'Linnaeus, 1758', 'Cá chạch bùn hoa', 'SPA_03004', 'Gai lưng ( tổng cộng): 3; Tia mềm vùng lưng (tổng cộng): 6-8; Gai hậu môn : 3; Tia mềm hậu môn : 5; Đốt sống : 40 - 42. Vây đuôi có 15-16 tia (Ref. 2196 ). Một đốm nhỏ ở gốc đuôi trên. Sắc tố (vùng sắc tố dọc Gambetta): vùng Z1-Z4 thường biệt hóa rõ, kéo dài về phía sau đến cuống đuôi; chiều cao các đốm vùng Z4 thường nhỏ hơn 2 lần chiều dài của chúng; nếu lớn hơn 2 lần thì chiều cao bằng hoặc lớn hơn đường kính ngang của mắt. Một lá tròn', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'fishbase.'),
