(2997, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Cobitidae', 'Cá Chạch', 'FAM_094', 'Misgurnus', NULL, 'GEN_1238', 'misgurnusanguillicaudatus', 'Misgurnus anguillicaudatus', '(Cantor 1842)            ', NULL, 'SPA_03010', 'Thân tròn dài. Đuôi dẹp bên, nếp da trên cuống đuôi ít phát triển. Đầu nhọn, nhỏ, hơi tròn. Mắt bé, ở hai bên đầu. Không có gai dưới mắt. Có 5 đôi râu miệng. Thân phủ vảy tròn. Đầu không có vảy.\n\nVây đuôi hình tròn, tuyến bên hoàn chỉnh. Hai bên lưng màu tro đậm, có con có đốm đen xen kẽ.', NULL, 'Chạch bùn còn gọi là chạch đồng. Là một loài cá kinh tế cỡ nhỏ, sống chủ yếu ở lớp bùn trong ao, hồ, ruộng lúa, kênh mương… Ở nước ta, chạch bùn thường gặp ở các tỉnh miền Bắc và Bắc Miền Trung. Chạch bùn cũng phân bố rộng rãi ở một số nước châu Á như Nhật Bản, Triều Tiên, Trung Quốc.', NULL, NULL, NULL, NULL, NULL, NULL, 'tepbac'),
