(3000, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Cobitidae', 'Cá Chạch', 'FAM_094', 'Pangio', NULL, 'GEN_1432', 'pangioanguillaris', 'Pangio anguillaris', '(Vaillant, 1902)', '', 'SPA_03013', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3001, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Cobitidae', 'Cá Chạch', 'FAM_094', 'Syncrossus', NULL, 'GEN_1892', 'syncrossusbeauforti', 'Syncrossus beauforti', '(Smith, 1931)', 'cá heo chấm', 'SPA_03014', 'Có 9-12 sọc dọc mờ với các hàng đốm dọc xếp chồng lên nhau có kích thước khác nhau; một số sọc dọc trên đầu và phần trước trên của cơ thể; viền đen và 3 hàng đốm dọc trên vây lưng; vài hàng đốm dọc trên vây đuôi,  9 tia vây lưng phân nhánh; gai sàng thẳng không bao giờ vuông góc với mõm khi nhìn từ trên xuống; thùy não nhỏ, môi dưới không có nhú Thường gắn liền với nước trong, dòng chảy xiết và chất nền từ đá đến đá. Được tìm thấy ở các sông vừa và nhỏ. Mượn cát hoặc đào hố dưới đá. Đi vào rừng ngập trong thời kỳ nước dâng cao và quay trở lại sông vào tháng 11 và tháng 12 ở hạ lưu sông Mê Kông. Ăn động vật thân mềm và động vật giáp xác. Không dung nạp nitrat, nó nhanh chóng biến mất khỏi những khu vực bón phân cho cây trồng', NULL, ' lưu vực sông Mê Kông, Chao Phraya và Meklong; phía bắc bán đảo Mã Lai.', NULL, NULL, NULL, NULL, NULL, NULL, 'fishbase'),
(3002, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Cobitidae', 'Cá Chạch', 'FAM_094', 'Syncrossus', NULL, 'GEN_1892', 'syncrossushelodes', 'Syncrossus helodes', '(Sauvage, 1876)', 'cá heo', 'SPA_03015', 'Thân tương đối dài, dẹp bên. Đầu dẹp bên, mõm nhọn, chót mõm có hai đôi râu nhỏ dính nhau ở gốc. Có 3 đôi râu: 2 đôi râu mõm và 1 đôi râu mép.\nMắt nhỏ, không bị da che phủ, nằm lệch về mặt lưng của đầu gần điểm cuối nắp mang hôn chót mõm. Phần trán giữa 2 mắt hẹp và cong lồi. Vảy nhỏ, mịn, rất khó thấy.\nMặt lưng của đầu và thân có màu vàng đậm và lợt dần xuống mặt bụng, bụng có màu vàng lợt. Mặt lưng của đầu có 4 sọc đen hình vòng cung đối xứng thành từng cặp qua mặt phẳng đối xứng của thân. Mỗi bên thân có 10 -11 sọc ngang, chiều rộng của sọc lớn hơn khoảng cách 2 sọc. Có nhiều sọc đậm vắt ngang các tia vây lưng, vây đuôi và vây hậu môn. Các vây có màu vàng đến màu vàng cam.\nCá có thể đạt đến 25-30cm chiều dài. ăn động vật tuy nhiên khi đói cá có thể ăn thực vật bao gồm cả cây thủy sinh. Khi trưởng thành cá cái có bụng to tròn hơn cá đực.', NULL, 'Việt Nam có phân bố nhiều ở đồng bằng sông Cửu Long. Thái Lan, Malaixia, Lào, Xumatra, Giava, Borneo, Campuchia', NULL, NULL, NULL, NULL, NULL, NULL, 'tepbac'),
