(3006, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Eleotridae', 'Cá Bống Đen', 'FAM_130', 'Butis', NULL, 'GEN_0270', 'butisbutis', 'Butis butis', '(F. Hamilton, 1822)', 'Cá bống trân/Cá bống cau', 'SPA_03019', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3007, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Eleotridae', 'Cá Bống Đen', 'FAM_130', 'Butis', NULL, 'GEN_0270', 'butiskoilomatodon', 'Butis koilomatodon', '(Bleeker, 1849)', NULL, 'SPA_03020', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3008, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Eleotridae', 'Cá Bống Đen', 'FAM_130', 'Eeleotris', NULL, 'GEN_0631', 'eeleotrisfusca', 'Eeleotris fusca', '(Forster, 1801)', NULL, 'SPA_03021', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3009, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Eleotridae', 'Cá Bống Đen', 'FAM_130', 'Eeleotris', NULL, 'GEN_0631', 'eeleotrismelanosoma', 'Eeleotris melanosoma', 'Bleeker, 1853', NULL, 'SPA_03022', 'Cá có đầu ngắn, to, tròn. Mõm ngắn, hướng lên, hàm dưới dài hơn hàm trên và hướng ra trước. Răng nhọn, mịn. Mắt nhỏ, tròn, nằm nửa phía trên đầu. Thân tròn, phần sau thân dẹp bên, cuống đuôi thon dài. Hai vây lưng tách rời nhau. Cơ gốc vây ngực phát triển, hai vây bụng không dính liền nhau. Thân cá có màu xám nhạt, có nhiều đốm đậm phủ khắp thân. \n\nBống trứng là một loài cá nước ngọt, hình dáng nhỏ con, to nhất chỉ bằng ngón tay. Bống trứng hàng năm thường xuất hiện trên các sông rạch vào mùa nước son (tháng sáu) và kéo dài cho đến tháng chín âm lịch. Tuy nhỏ nhưng trong bụng mỗi con đều chứa một bầu trứng căng tròn, vàng hượm.\n\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'tepbac.'),
(3010, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Eleotridae', 'Cá Bống Đen', 'FAM_130', 'Eleotris', NULL, 'GEN_0638', 'eleotrisfusca', 'Eleotris fusca', '(Forster, 1801)', 'Cá bống đen', 'SPA_03023', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3011, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Eleotridae', 'Cá Bống Đen', 'FAM_130', 'Eleotris', NULL, 'GEN_0638', 'eleotrissp', 'Eleotris sp.', NULL, 'Cá bống đen trán dô', 'SPA_03024', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3012, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Eleotridae', 'Cá Bống Đen', 'FAM_130', 'Odontobutis', NULL, 'GEN_1355', 'odontobutisobscuris', 'Odontobutis obscuris', '(Temminck & Schlegel, 1845)', NULL, 'SPA_03025', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3013, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Eleotridae', 'Cá Bống Đen', 'FAM_130', 'Oxyeleotris', NULL, 'GEN_1414', 'oxyeleotrismarmorata', 'Oxyeleotris marmorata', '(Bleeker, 1852)', 'cá bống tượng', 'SPA_03026', 'Cá bống tượng có kích thước lớn nhất trong họ cá bống nước ngọt, có thân hình thoi tròn. Cá có hàm răng sắc nhọn của các loài cá ăn động vật. Mình cá có nhiều màu đen, điểm thêm ít vằn nâu, đầu to hơn so với thân. Và điểm đặc biệt khó có thể nhầm lẫn cá bống tượng là dưới đuôi có hình chữ V màu đen.\nKhi lật ngửa vảy bụng và lưng đều, các vây nguyên, cá có nhiều nhớt, màu lưng hơi xám, da bóng, mang phùng thật to và các vây xoè ra hết cỡ, có trọng lượng trung bình khoảng 50 - 100g. Cá bống tượng giống với những loài cá bống khác, nhất là trong thời kỳ còn nhỏ nhưng lúc lớn chúng có trọng lượng lớn, có thể đạt đến vài kg. Cá bống tượng khoẻ, thịt dày, ngon, thịt cá khi chế biến có màu trắng tinh như thịt gà, có độ dai và có vị ngọt.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/C%C3%A1_b%E1%BB%91ng_t%C6%B0%E1%BB%A3ng'),
(3014, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Eleotridae', 'Cá Bống Đen', 'FAM_130', 'Percottus', NULL, 'GEN_1502', 'percottuschamersi', 'Percottus chamersi', 'Dybowski, 1877.', NULL, 'SPA_03027', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3015, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Eleotridae', 'Cá Bống Đen', 'FAM_130', 'Percottus', NULL, 'GEN_1502', 'percottussp1', 'Percottus sp1.', NULL, 'Cá bống suối', 'SPA_03028', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3016, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Eleotridae', 'Cá Bống Đen', 'FAM_130', 'Percottus', NULL, 'GEN_1502', 'percottussp2', 'Percottus sp2.', NULL, 'Cá bống suối', 'SPA_03029', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3017, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Eleotridae', 'Cá Bống Đen', 'FAM_130', 'Percottus', NULL, 'GEN_1502', 'percottustonkinensis', 'Percottus tonkinensis', 'Mai, 1978.', 'Cá bống suối Bắc Bộ', 'SPA_03030', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3018, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Gerreidae', 'Cá Móm', 'FAM_158', 'Gerres', NULL, 'GEN_0757', 'gerresdecoratus', 'Gerres decoratus', '(Herre, 1927)', 'Cá móm ', 'SPA_03031', 'Sinh sống trong khu vực nhiệt đới và ôn đới. Chủ yếu là cá nước mặn và nước lợ duyên hải, nhưng có vài loài là cá nước ngọt. Các loài cá móm là con mồi và cá mồi phổ biến tại nhiều nơi trên thế giới, bao gồm vùng duyên hải Nam Mỹ và các đảo Caribe cũng như vùng vịnh Mexico và vùng ven Đại Tây Dương ở Bắc Mỹ.[2] Các loài cá này khó phân biệt và nhận dạng trên hiện trường và thường cần có kiểm tra bằng kính hiển vi. Phần lớn các loài thể hiện tập tính bơi thành bầy cá và có xu hướng khai thác những nơi trú ản trong vùng nước nông gắn với vùng duyên hải, có lẽ để tránh những kẻ săn mồi to lớn, như cá mập chanh.\nMiệng có thể dễ dàng kéo dài. Đầu có vảy nhưng mặt trên nhẵn. Vây lưng và vây hậu môn có màng bao vảy dọc theo phần gốc. Các màng mang không hợp nhất thành eo. Đuôi chẻ sâu; 24 đốt sống. Chiều dài tối đa 35 xentimét (14 in), đạt được ở Gerres filamentosus. Cá nhỏ màu bạc với miệng rất lồi. Chúng kiếm ăn bằng cách lựa chọn các động vật không xương sống tầng đáy từ trong cát. Là cá thực phẩm. Được cho là cá không bảo vệ trứng. Hầu hết các loài trưởng thành xuất hiện ở các đầm phá ven biển với đáy cát hoặc bùn lầy giáp với rừng ngập mặn; tuy nhiên, đôi khi chúng cũng bơi vào cửa sông. Cá non bơi vào cửa sông cho đến khi chúng trưởng thành. Sinh sản ở biển quanh năm', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/H%E1%BB%8D_C%C3%A1_m%C3%B3m'),
(3019, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Gobiidae', 'Cá Bống Trắng', 'FAM_163', 'Acentrogobius', NULL, 'GEN_0016', 'acentrogobiuscaninus', 'Acentrogobius caninus', '(Valenciennes, 1837)', 'cá bống chấm', 'SPA_03032', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
