(3024, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Gobiidae', 'Cá Bống Trắng', 'FAM_163', 'Brachygobius', NULL, 'GEN_0242', 'brachygobiusdoriae', 'Brachygobius doriae', '(Günther, 1868)', 'Cá bống mắt tre ', 'SPA_03037', 'Cá có kích thước nhỏ (tối đa 3cm), thân hình trụ tựa ống điếu. Nền thân màu vàng xen kẽ 4 mảng đen rộng bản trông tựa các mắt (đốt) thân tre. Các vây màu trắng trong có lẫn các đốm đen', NULL, 'Cá phân bố ở Indonexia, Malyxia, Brunei, Singapo và Việt Nam (Đồng bằng sông Cửu Long).', NULL, NULL, NULL, NULL, NULL, NULL, 'https://tepbac.com/species/full/134/ca-bong-mat-tre.htm'),
(3025, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Gobiidae', 'Cá Bống Trắng', 'FAM_163', 'Brachygobius', NULL, 'GEN_0242', 'brachygobiussp', 'Brachygobius sp.', NULL, 'Cá bống', 'SPA_03038', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3026, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Gobiidae', 'Cá Bống Trắng', 'FAM_163', 'Brachygobius', NULL, 'GEN_0242', 'brachygobiusxanthomelas', 'Brachygobius xanthomelas', 'Herre, 1937', 'Cá bống mắt tre ', 'SPA_03039', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3027, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Gobiidae', 'Cá Bống Trắng', 'FAM_163', 'Glossogobius', NULL, 'GEN_0765', 'glossogobiusgiurus', 'Glossogobius giurus', '(F. Hamilton, 1822)', NULL, 'SPA_03040', 'Thân thon dài, dẹp ngang dần về phía sau. Đầu dẹp đứng, mõm dài và nhọn. Mắt to, nằm trên mặt lưng của đầu. Khoảng cách giữa hai ổ mắt nhỏ hơn đường kính mắt. Miệng rộng, xiên. Hàm dưới hơi nhô ra, môi dày. Khe mang rộng. Trên má có 5 đường cảm giác chạy song song. Đỉnh đầu phủ vảy đến sau ổ mắt. Trên nắp mang có vảy nhỏ. Thân phủ vảy lược tương đối lớn. Hai vây lưng rời nhau. Điểm kết thúc của vây lưng thứ hai nằm trước vây hậu môn. Vây đuôi tù tròn. Phần lư¬ng màu xám đen, bụng trắng nhạt. Dọc bên hông có 5 đốm đen tròn to. Đốm ở cuống đuôi rõ nhất. Vây ngực đen nhạt. Vây bụng trắng. Vây lưng và vây đuôi có các chấm đen xếp thành hàng.', NULL, 'Thế giới: Thái Lan, Philipin, Lào, Campuchia, Malaixia, Inđônêxia.\n\nViệt Nam: gặp nhiều ở đồng bằng Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'tepbac.'),
(3028, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Gobiidae', 'Cá Bống Trắng', 'FAM_163', 'Glossogobius', NULL, 'GEN_0765', 'glossogobiussparsipapillus', 'Glossogobius sparsipapillus', 'Akihito & Meguro, 1976          ', 'Cá bống cát hay, cá bống cát trắng ', 'SPA_03041', 'Thân thon dài, phía sau dẹp ngang. Đầu dẹp đứng. Mõm dài và nhọn. Mắt gần như nằm ngang trên đỉnh đầu. Hai lỗ mũi tương đối gần nhau. Lỗ mũi trước hình ống. Miệng rộng, xiên, hàm dưới nhô ra, rạch miệng kéo dài đến bở trước của ổ mắt. Trên mỗi hàm có nhiều hàng răng, hàng trong và ngoài cùng nở rộng. Lưỡi chẻ đôi. Khe mang rộng. Trên má có 5 đường cảm giác chạy song song, tất cả đều là đường đơn. Vảy tròn trước vây lưng nhỏ kéo dài đến bờ sau ổ mắt. Thân phủ vảy lược to.\nVây lưng hai các rời nhau. Khởi điểm vây lưng thứ hai trước vây hậu môn. Vây ngực tròn dài. Vây bụng hình bầu dục dài. Vây đuôi tù. Thân có màu nâu hoặc vàng nhạt. Có 5 đường đốm đen nhạt dọc theo đường giữa hông. Bề rộng đốm đen nhỏ hơn chiều cao thân tại chỗ đó. Trên nắp mang có màu đen. Vây lưng, vây đuôi có màu lốn đốm điểm đen. Vây ngực, vây bụng và vây hậu môn có màu sắc đơn giản (khi còn sống cá có màu nhạt hơn loài Glossogobius giuris).\nCá có kích thước tương đối lớn. Thịt ngon. Cá sống trong nước ngọt và nước lợ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&img=1&ID=5812'),
(3029, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Gobiidae', 'Cá Bống Trắng', 'FAM_163', 'Gobiopterus', NULL, 'GEN_0773', 'gobiopteruschuno', 'Gobiopterus chuno', '(Hamilton, 1822)', NULL, 'SPA_03042', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3030, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Gobiidae', 'Cá Bống Trắng', 'FAM_163', 'Gobius', NULL, 'GEN_0774', 'gobiuspoecilichthys', 'Gobius poecilichthys', 'Jordan & Snyder', NULL, 'SPA_03043', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3031, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Gobiidae', 'Cá Bống Trắng', 'FAM_163', 'Neodontobutis', NULL, 'GEN_1295', 'neodontobutistonkinensis', 'Neodontobutis tonkinensis', '(Mai, 1978)', 'Cá Bống suối', 'SPA_03044', 'Thân có khoảng 8 sọc nâu sẫm; vây lưng thứ nhất có 7 tia; vây bụng tách ra', NULL, 'Châu Á: Lào và Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'https://fishbase.mnhn.fr/summary/60235'),
(3032, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Gobiidae', 'Cá Bống Trắng', 'FAM_163', 'Oxyurichthys', NULL, 'GEN_1417', 'oxyurichthysmicrolepis', 'Oxyurichthys microlepis', '(Bleeker, 1849)', 'Cá Bống chấm mắt', 'SPA_03045', 'Loài cá này xuất hiện ở đồng bằng sông Cửu Long và được cho rằng đã sử dụng dòng chảy thủy triều sông để vào sâu trong nội địa Campuchia. [4] Chúng có thể đạt chiều dài 13,5 xentimét (5,3 in). Loài cá này có tầm quan trọng đối với khai thác thủy sản thương mại địa phương và đôi khi cũng có thể được tìm thấy trong lĩnh vực buôn bán cá cảnh', NULL, 'là một loài cá bống[2] xuất xứ từ vùng biển nhiệt đới và vùng nước lợ dọc theo bờ biển Ấn Độ Dương, từ Châu Phi đến Tây Thái Bình Dương, nơi chúng thường xuất hiện ở các cửa sông và vùng nước ven bờ đến độ sâu khoảng 75 mét', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/C%C3%A1_b%E1%BB%91ng_ch%E1%BA%A5m_m%E1%BA%AFt'),
(3033, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Gobiidae', 'Cá Bống Trắng', 'FAM_163', 'Papuligobius', NULL, 'GEN_1438', 'papuligobiusocellatus', 'Papuligobius ocellatus', '(Fowler, 1937)', 'cá bống mắt', 'SPA_03046', 'Gai lưng: 7; Tia mềm vùng lưng: 9-11; Gai hậu môn: 1; Tia mềm hậu môn : 8 - 9; Đốt sống : 26. Đầu lõm xuống và thân hơi hình trụ; thường có thân rất sẫm đến gần như đen hoàn toàn, với các đốm màu xanh lục hoặc hơi vàng (ở đời sống) ít nhiều được tổ chức thành các thanh dọc.  đốm đen ở cực trên của gốc đuôi Con trưởng thành được tìm thấy ở các con sông có kích thước từ trung bình đến lớn. Chúng ăn côn trùng và động vật phù du', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Fishbase'),
