(3035, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Gobiidae', 'Cá Bống Trắng', 'FAM_163', 'Pseudogobius', NULL, 'GEN_1654', 'pseudogobiusjavanicus', 'Pseudogobius javanicus', '(Bleeker, 1856)', NULL, 'SPA_03048', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3036, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Gobiidae', 'Cá Bống Trắng', 'FAM_163', 'Rhinogobius', NULL, 'GEN_1731', 'rhinogobiusgiurinus', 'Rhinogobius giurinus', '(Rutter, 1897)', 'Cá Bống mắt', 'SPA_03049', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3037, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Gobiidae', 'Cá Bống Trắng', 'FAM_163', 'Rhinogobius', NULL, 'GEN_1731', 'rhinogobiushadropterus', 'Rhinogobius hadropterus', '(Jordan & Snyder, 1901)', 'Cá bống đá khe', 'SPA_03050', 'Là một loài cá bống có nguồn gốc từ Đông Á, chúng sinh sống ở vùng biển, nước lợ và nước ngọt của sông và cửa sông. Loài này có thể đạt đến chiều dài 8 cm (3,1 in) TL. Nó có tầm quan trọng đối với người dân địa phương như một loại cá thực phẩm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.'),
