(3042, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Gobiidae', 'Cá Bống Trắng', 'FAM_163', 'Stigmatogobius', NULL, 'GEN_1865', 'stigmatogobiussadanundio', 'Stigmatogobius sadanundio', '(F. Hamilton, 1822)', 'Cá bống mít', 'SPA_03055', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3043, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Gobiidae', 'Cá Bống Trắng', 'FAM_163', 'Tridentiger', NULL, 'GEN_1987', 'tridentigersp', 'Tridentiger sp.', NULL, 'Cá bống lụa', 'SPA_03056', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3044, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Leiognathidae', 'Cá Liệt', 'FAM_213', 'Leiognathus', NULL, 'GEN_1042', 'leiognathuserythropterus', 'Leiognathus erythropterus', 'Lacépède, 1802', 'Cá móm ', 'SPA_03057', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3045, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Scatophagidae', 'Cá Nâu', 'FAM_330', 'Scatophagus', NULL, 'GEN_1786', 'scatophagusargus', 'Scatophagus argus', '(Linnaeus, 1766)', 'Cá nâu ', 'SPA_03058', 'Cá nâu có thân cá dẹp bên, thân cao, lưng hình vòm, nhìn ngang gần như tròn. Đầu nhỏ, ngắn, mõm tù, miệng nhỏ, rạch miệng nằm ngang và ngắn, hàm có răng mịn, viền trước gốc vây lưng dốc xuống và có một vết lõm sâu sau mắt. Mắt cá lớn vừa phải nằm gần về phía đầu. Cấu tạo phần đầu là dấu hiệu rõ ràng nhất để phân biệt cá đực cá cái. Cá cái phần đầu là một đường thẳng, cá đực phần đầu gấp khúc, cá cái có màu xanh ô liu, cá đực màu xám đen\nChúng có vảy lược nhỏ phủ khắp thân, vảy đường bên hoàn toàn không ngắt quãng, phía trước cong lên theo viền lưng. Phần trước có gai của vây lưng tương đối phát triển, cuống đuôi ngắn không phân thùy. Vây lưng, vây hậu môn và vây đuôi có vân đen nhạt, lưng màu nâu nhạt. Nửa trên thân có các đốm tròn màu nâu, đen xếp xen kẽ không đều nhau, các đốm này nhạt dần về phía bụng', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/C%C3%A1_n%C3%A2u'),
(3046, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'PERCIFORMES', 'CÁ VƯỢC', 'ORD_062', 'Serranidae', 'Cá Mú', 'FAM_340', 'Coreoperca', NULL, 'GEN_0468', 'coreopercawhiteheadi', 'Coreoperca whiteheadi', 'Boulenger, 1900', NULL, 'SPA_03059', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
