(3050, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SCORPAENIFORMES', NULL, 'ORD_077', 'Indostomidae', NULL, 'FAM_198', 'Indostomus', NULL, 'GEN_0960', 'indostomusparadoxus', 'Indostomus paradoxus', 'Prashad and Mukerji, 1929', '', 'SPA_03063', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3051, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Amblycipitidae', 'Cá Lăng Suối', 'FAM_015', 'Amblyceps', NULL, 'GEN_0073', 'amblycepsmangois', 'Amblyceps mangois', '(Hamilton, 1822)', '', 'SPA_03064', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3052, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Bagrichthys', NULL, 'GEN_0199', 'bagrichthysmacracanthus', 'Bagrichthys macracanthus', '(Bleeker, 1854)', 'Cá chốt chuột', 'SPA_03065', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3053, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Cranoglanis', NULL, 'GEN_0480', 'cranoglanissinensis', 'Cranoglanis sinensis', '(Peters, 1880)', 'Cá ngạnh', 'SPA_03066', 'Vây lưng: I, 6, vây ngực: I, 9, vây bụng I, 10, vây hậu môn: 40. Cá có thân trơn láng, không vảy. Đầu dẹp bằng, thân dẹp bên. Có 4 đôi râu. Mõm cá tù. Miệng ở phía dưới. Môi trên dày. Khoảng cxách hai ổ mắt rộng. Có 1 rãnh sâu ở giữa đỉnh đầu chạy từ chẩn tới quy mắt. Khe mang rộng.\n\nVây lưng có một tia gai cứug có khía răng cưa thưa và nhỏ ở cả hai phía. Vây hậu môn dài. Vây đuôi chẻ sâu, hai thùy bằng nhau. Vây mỡ nhỏ. Đường bên rõ và thẳng. Cá có lưng và hai bên thân màu xám, bụng màu nhạt. Cá thuộc nhóm ăn tạp. Thức ăn là các động vật không xương sống, côn trùng, cá con và cả động vật thượng đẳng. Cá ngạnh thành thục sau 2 năm. Mùa sinh sản vào tháng 4 - 6. Cá đẻ ở hang đá ven bờ, hạ lưu cá sông lớn. Cá bố mẹ có tập tính bảo vệ trứng. Cá ngạnh sống ở tầng giữa.', NULL, 'Việt Nam: Có ở hầu hết ở vùng đồng bằng và trung lưu cá sông lớn miền bắc nước ta: Hà Nội (sông Hồng, Hưng Yên, Nam định, Thanh Hóa (sông Mã, Nghệ An (sông Lam vùng Con Cuông). Thế giới: Trung Quốc.', NULL, NULL, 'Cá ngạnh thịt ăn rất ngon. Cá có triển vọng trở thành loài cá nuôi. Sản lượng tự nhiên cũng khá.', 'VU', NULL, NULL, 'VnCreature'),
(3054, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Hemibagrus', NULL, 'GEN_0844', 'hemibagruscentralus', 'Hemibagrus centralus', 'Mai, 1978', NULL, 'SPA_03067', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3055, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Hemibagrus', NULL, 'GEN_0844', 'hemibagruselongatus', 'Hemibagrus elongatus', '(Gunther)', NULL, 'SPA_03068', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3056, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Hemibagrus', NULL, 'GEN_0844', 'hemibagrusfilamentus', 'Hemibagrus filamentus', '(Fang & Chaux, 1949)', 'cá lăng vàng', 'SPA_03069', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3057, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Hemibagrus', NULL, 'GEN_0844', 'hemibagrusguttatus', 'Hemibagrus guttatus', '(Lacepède, 1803)', 'Cá  lăng', 'SPA_03070', 'Cá cỡ lớn, thân trần dài, phần trước dẹp bằng, sau dẹp bên. Đầu rộng, bẹt và tương đối dài. Mõm rộng, phía trước hơi bằng. Mắt ở phía trên và nửa trước của đầu. Khoảng cách 2 mắt rộng bằng. Lỗ mũi trước và sau xa nhau. Có 4 đôi râu. Râu hàm dài nhất tới mút sau vây bụng. Miệng to, kề dưới, hình cung nông. Hai hàm có răng dạng lông nhung xếp thành dải. Răng trên xương vòm xếp thành dải hình cung nông, giữa nhỏ và 2 bên to hơn. Vây lưng cao, tia gai vây lưng dài, phía sau có răng cưa. Hậu môn gần vây bụng hơn vây hậu môn. Vây đuôi phân thuỳ sâu. Đường bên hoàn toàn, bằng thẳng. Bóng hơi 2 ngăn. Lưng xám đen, bụng trắng nhạt, bên thân có nhiều chấm đen to nhỏ. Vây lưng, vây mỡ và vây đuôi màu hơi đen. Vây ngực, vây bụng và vây hậu môn màu nhạt. Cá sống ở tầng đáy, có kích thước lớn, tối đa tới 40kg/con, thường gặp cỡ 1 - 4kg. Cá lăng chấm ở sông Hồng sau 1 năm dài 22 - 25cm, sau 2 năm chiều dài tăng gấp đôi. Những năm sau cá tăng trưởng chiều dài giảm nhưng tăng về khối lượng nhanh. Cá có tuổi lớn nhất tới 13 - 15 năm. Cá lăng là loài cá dữ điển hình. Cá nhỏ có phổ thức ăn khá rộng gồm: ấu trùng, côn trùng, giun ít tơ, rễ cây... Cá lớn ăn chủ yếu là cá con, tôm cua, mùn bã hữu cơ, thực vật... Cá lăng cái thành thục vào tuổi 3+, dài 61cm, nặng 1,6kg. Cá đực thành thục vào 4 tuổi, dài 72cm, nặng 2,7kg. Mùa sinh sản từ tháng 4 - 6, đẻ muộn có thể tới tháng 8. Khi sinh sản cá di cư lên vùng trung và thượng lưu các sông, nơi nước chảy, đáy nhiều sỏi đá. Bãi Cá lăng đẻ trên sông Hồng tập trung từ Yên Bái lên Lào Cai, trên sông Đà từ Tạ Khoa (Sơn La) lên Lai Châu; trên sông Lô - Gâm từ Tuyên Quang đến Hà Giang. Cá đẻ trứng trong hang đá, hốc ngầm tự nhiên hoặc đào thành hố để đẻ. Cá bố mẹ có tập tính chăm sóc con cái.', NULL, 'Trong nước: Các sông lớn ở phía Bắc: sông Hồng, sông Thái Bình, sông Kỳ Cùng, sông Mã, sông Lam tới sông Trà Khúc - Quảng Trị. Thế giới: Trung Quốc và Lào.', NULL, NULL, 'Là loài cá quý, hiếm. Sản lượng cá ở trung và thượng lưu các sông lớn khá cao. Cá có triển vọng trở thành cá nuôi.', 'VU', NULL, NULL, 'VnCreature'),
(3058, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Hemibagrus', NULL, 'GEN_0844', 'hemibagrusmicrophthalmus', 'Hemibagrus microphthalmus', '(Day,1877)', 'Cá Lăng đỏ', 'SPA_03071', 'đầu lõm xuống, tấm chắn đầu xù xì không được da che phủ, chẩm mảnh và các vây mỡ dài vừa phải.', NULL, 'Châu Á: Hệ thống thoát nước Manipur ở Ấn Độ, hệ thống thoát nước Irrawaddy và Sittang ở Myanmar và sông Salween của Thái Lan. Ghi nhận từ hệ thống sông Mê Kông ở miền nam Lào.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.planetcatfish.com/common/species.php?species_id=4393'),
(3059, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Hemibagrus', NULL, 'GEN_0844', 'hemibagrusnemurus', 'Hemibagrus nemurus', '(Valenciennes, 1840)', 'cá lăng vàng', 'SPA_03072', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3060, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Hemibagrus', NULL, 'GEN_0844', 'hemibagrusvietnamicus', 'Hemibagrus vietnamicus', 'Đ. Y. Mai, 1978', NULL, 'SPA_03073', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3061, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Hemibagrus', NULL, 'GEN_0844', 'hemibagruswyckii', 'Hemibagrus wyckii', '(Bleeker, 1858)', 'cá lăng ki', 'SPA_03074', 'Cá thể lớn tối đa là 40 cm. Thân thon dài, dẹp bên. Đầu rộng và dẹp bằng, trơn. Mắt nằm gần đỉnh đầu. Răng lá mía trên một dãy cong và liên tục. Có 4 đôi râu, râu mũi gần đến mắt, râu hàm trên đến hậu môn, râu cằm ngoài và râu cằm trong dài đến màng mang. Gai cứng vây lưng và vây ngực có răng cửa ở mặt sau. Vây mỡ và vây hậu môn trung bình. Vây đuôi phân thùy sâu. Thân màu vàng thẫm, phân lưng thẫm, phân fbungj trắng hơn. Vây ngực và vây bụng xám nhạt. Có 1 đốm sau màng mang gần gốc vậy ngực', NULL, 'Trên thế giới ghi nhận được hầu hết có ở các nước Đông Nam Á. Việt Nam gặp ở Tây nguyên và Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'http://vuonquocgiabugiamap.vn/vi/dongthucvat/detail-49/ca-lang-ki/'),
(3062, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Hemibagrus', NULL, 'GEN_0844', 'hemibagruswyckioides', 'Hemibagrus wyckioides', '(Fang & Chaux, 1949)', 'cá lăng nha', 'SPA_03075', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3063, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Leiocassis', NULL, 'GEN_1041', 'leiocassispoecilopterus', 'Leiocassis poecilopterus', '(Valenciennes, 1840)', '', 'SPA_03076', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3064, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Leiocassis', NULL, 'GEN_1041', 'leiocassisspp', 'Leiocassis spp', NULL, '  ', 'SPA_03077', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3065, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Mystus', NULL, 'GEN_1283', 'mystusalbolineatus', 'Mystus albolineatus', 'Roberts, 1994', 'cá chốt', 'SPA_03078', 'Thân dài và rất dẹp bên. Đầu nhỏ, dẹp bằng, mặt dưới phẳng hơn mặt trên. Mõm tù. Có 4 đôi râu. Râu mép dài nhất. Và kéo dài quá ngọn vây đuôi. Mắt to không được da che phủ, nằm lệch về mặt lưng của đầu và gần như cách đều chót mõm với điểm cuối nắp mang.Màng mang phát triển, tách rời nhau và không dính với eo mang.\nVây mỡ rất dài, phần trước của vây mỡ chạm với vây lưng. Toàn thân cá có màu xanh lá cây hay xám xanh, phần lưng sậm hơn phần bụng. Dọc đường bên có một sọc trắng. Vây lưng, vây đuôi, vây mỡ có màu xanh xám. Vây ngực, vây bụng, vây hậu môn phần ngọn sậm hơn phần gốc và màng da giữa các tia vây có màu đen.\nKích thước tối đa: 40cm. ', NULL, ' ở Việt Nam gặp nhiều ở khu vực đồng bằng sông Cửu Long. Giava, Xumatra, Borneo, ấn Độ, Thái Lan, Lào', NULL, NULL, NULL, NULL, NULL, NULL, 'Tepbac'),
(3066, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Mystus', NULL, 'GEN_1283', 'mystusgulio', 'Mystus gulio', '(Hamilton, 1822)', 'cá chốt', 'SPA_03079', 'là loài cá da trơn cỡ nhỏ đến trung bình phân bố ở Nam Á.  công nhận Mystus có thóp sọ dài chạm tới tận gốc chẩm, râu hàm trên dài, vây mỡ rất dài, 11–30 lược mang trên cung mang đầu tiên và tổng cộng 37–46 đốt sống, gần bằng nhau. chia thành vùng bụng và vùng đuôi. Dễ dàng nhận biết bởi thân màu xỉn và vây mỡ rất ngắn. Con đực có nhú sinh dục thon dài ở phía trước vây hậu môn. ', NULL, ' Châu Á: các quốc gia giáp Đông Ấn Độ Dương, từ Ấn Độ đến Indonesia và Việt Nam. Báo cáo từ Pakistan. vùng biển Ấn Độ', NULL, NULL, NULL, NULL, NULL, NULL, 'Planetcatfish'),
(3067, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Mystus', NULL, 'GEN_1283', 'mystusmultiradiatus', 'Mystus multiradiatus', 'Roberts, 1992', 'cá chốt sọc', 'SPA_03080', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3068, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Mystus', NULL, 'GEN_1283', 'mystusmysticetus', 'Mystus mysticetus', 'Roberts, 1992', 'cá chốt sọc', 'SPA_03081', 'Cá chốt sọc có màu nền thân trắng xám, với 3 sọc nâu đen chạy dọc thân từ sau nắp mang đến cuống đuôi. Miệng rộng với 4 đôi râu. Cá ăn các loại côn trùng, giáp xác, phiêu sinh động, thức ăn viên. Cá đẻ trứng trong hốc đá, hiện chưa sinh sản trong bể cảnh.', NULL, ' Lưu vực sông Mêkông và Chao Phraya: Thái Lan, Lào, Campuchia và Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'Tepbac'),
(3069, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Mystus', NULL, 'GEN_1283', 'mystusrhegma', 'Mystus rhegma', 'Fowler, 1935', 'cá chốt vạch', 'SPA_03082', 'Gai lưng : 1; Tia mềm vùng lưng : 7; Tia mềm hậu môn : 11 - 14; Đốt sống : 41 - 43. Khác với tất cả các loài Mystus Sensu stricto khác ở chỗ có sọc đen dọc giữa, hẹp, được phân định rõ ràng (dọc theo ống tủy bên) và có phần gốc của các râu hàm ngoài hơi ở phía sau, thay vì ở phía trước, a đường thẳng đứng tới rìa sau của môi cứng. Vây mỡ tương đối ngắn, bắt nguồn từ khoảng cách khoảng một đường kính mắt sau vây lưng và chỉ kéo dài một khoảng ngắn đến cuống đuôi . Tổng số lược mang 24-28. Gốc vây mỡ dài hơn gốc vây hậu môn, có nguồn gốc hơi ở phía sau lưng; thóp sọ kéo dài về phía sau tới đáy mỏm chẩm Con trưởng thành xuất hiện ở các con sông và cánh đồng ngập nước có quy mô từ trung bình đến lớn . Ăn ấu trùng côn trùng, vảy cá và các bộ phận cơ thể cá khác, cũng như mảnh vụn thực vật. Thói quen sinh sản và sự di chuyển theo mùa vẫn chưa được biết rõ . Đẻ trứng, ghép đôi khác biệt có thể giống như các thành viên khác trong cùng một họ ', NULL, '  lưu vực Bangkok, Meklong và Chao Phraya ở Thái Lan và Hạ lưu sông Mê Kông.', NULL, NULL, NULL, NULL, NULL, NULL, 'Fishbase'),
(3070, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Mystus', NULL, 'GEN_1283', 'mystussingaringan', 'Mystus singaringan', '(Bleeker, 1846)', 'cá chốt sọc', 'SPA_03083', 'Đốt sống : 42 - 45. Thân màu xám đen đồng nhất; vây mỡ dài hơn nhiều so với vây hậu môn và tiếp giáp với vây lưng; râu rất dài, với râu hàm trên dài tới hoặc vượt quá gốc vây đuôi (Tham khảo 27732 ). Thóp sọ kéo dài đến tận đáy mỏm chẩm  Được tìm thấy ở tất cả các loại vùng đất ngập nước vùng đất thấp. Thường gắn liền với vùng nước chảy chậm, đục và đáy mềm. Con trưởng thành ăn ấu trùng côn trùng, động vật phù du và cá nhỏ. Di chuyển vào các khu rừng ven sông ngập nước trong thời kỳ nước dâng cao và quay trở lại sông vào tháng 11 và tháng 12. Đẻ trứng, ghép đôi khác biệt có thể giống như các thành viên khác trong cùng một họ. Thường được bán tươi. Cá thực phẩm thương mại và một số ngành kinh doanh cá cảnh. Ngư dân cho biết loài này sinh sản 2 hoặc 3 lần trong một năm', NULL, '  lưu vực Bangpakong, Chao Phraya, Meklong, Tapi và Pattani ở Thái Lan; Mê Kông bao gồm lưu vực Xe Bangfai (Lào), bán đảo Malaysia và hầu hết các lưu vực sông lớn hơn ở Sumatra, Borneo và Java.', NULL, NULL, NULL, NULL, NULL, NULL, 'Fishbase'),
(3071, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Mystus', NULL, 'GEN_1283', 'mystussp', 'Mystus sp.', NULL, 'Cá chốt ', 'SPA_03084', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3072, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Mystus', NULL, 'GEN_1283', 'mystuswyckioides', 'Mystus wyckioides', 'Chaux and Fang, 1949', 'Cá Lăng đuôi đỏ', 'SPA_03085', 'là loài cá da trơn có thể đạt chiều dài tiêu chuẩn lên tới 800 mm. Các loài của chi này có đầu lõm xuống, tấm chắn đầu xù xì không được da che phủ, chẩm mảnh và các vây mỡ dài vừa phải. Vây đuôi toàn bộ hoặc một phần màu đỏ. Con đực có nhú sinh dục ngay phía trước vây hậu môn. Trong tự nhiên, thức ăn bao gồm cá, tôm và cua.', NULL, ' Châu Á: lưu vực sông Mê Kông. Báo cáo từ các hệ thống sông Chao Phraya, Maeklong và Bán đảo Thái Lan.', NULL, NULL, NULL, NULL, NULL, NULL, 'Planetcatfish'),
(3073, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Pseudobagrus', NULL, 'GEN_1647', 'pseudobagrusfulvidraco', 'Pseudobagrus fulvidraco', '(Richardson, 1846)', 'Cá bò', 'SPA_03086', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3074, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Pseudobagrus', NULL, 'GEN_1647', 'pseudobagruskyphus', 'Pseudobagrus kyphus', 'Mai, 1978', 'Cá mịt tròn', 'SPA_03087', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3075, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Pseudobagrus', NULL, 'GEN_1647', 'pseudobagrusvinhensis', 'Pseudobagrus vinhensis', 'Tu.', NULL, 'SPA_03088', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3076, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Pseudobagrus', NULL, 'GEN_1647', 'pseudobagrusvirgatus', 'Pseudobagrus virgatus vinhensis', 'Tu, 1983.', 'Cá mịt', 'SPA_03089', 'được xác định bằng một cơ ngoài xương bả vai không có ống cảm giác sau và một cơ pterotic với sự mở rộng các lớp bên rộng. Đường bên hoàn chỉnh kéo dài đến hết vây đuôi. Con đực có nhú sinh dục thon dài ở phía trước vây hậu môn. ', NULL, ' Trung Quốc', NULL, NULL, NULL, NULL, NULL, NULL, 'Planetcatfish'),
(3077, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Bagridae', 'Cá Ngạnh', 'FAM_038', 'Pseudomystus', NULL, 'GEN_1661', 'pseudomystussiamensis', 'Pseudomystus siamensis', '(Regan, 1913)', 'Cá Chốt bông', 'SPA_03090', 'Phần trước của thân tròn, phần sau dẹp bên. Bụng tròn. Đầu nhỏ, mặt dưới dẹp bằng. Mõm hơi tù. Miệng dưới không co duỗi được. Có 4 đôi râu. Râu mép dài nhất và kéo chạm đến gốc vây ngực. Mắt nhỏ có dạng bầu dục, được da che phủ. Màng mang phát triển, lỗ mang rộng.', NULL, 'ào, Campuchia, Thái Lan. Ở Việt  Nam phân bố chủ yếu ở đồng bằng sông Cửu Long.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://tepbac.com/species/full/115/ca-chot-bong.htm'),
(3078, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Clariidae', 'Cá Trê', 'FAM_091', 'Ageneiogarra', NULL, 'GEN_0047', 'ageneiogarraimberba', 'Ageneiogarra imberba', '(Garman, 1912)', NULL, 'SPA_03091', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3079, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Clariidae', 'Cá Trê', 'FAM_091', 'Clarias', NULL, 'GEN_0425', 'clariasbatrachus', 'Clarias batrachus', '(Linneaus, 1758)', 'cá trê trắng', 'SPA_03092', 'Không có gai lưng, có 6 – 76 tia vây lưng mềm. Không có gai hậu môn, có 47 – 58 tia vây hậu môn mềm. Hàm trên hơi nhô. Các gai ngực nhám ở các cạnh ngoài và có răng cưa trong các cạnh trong. Xương chẩm có, chiều dài gấp 2 chiều rộng. Khoảng cách từ vây lưng đến xương chẩm dài gấ 4 – 5,5 lần khoảng cách từ chóp miệng đến xương chẩm. Gai sinh dục ở cá đực được kéo dài và nhọn. ', NULL, ' Malaysia, Thái Lan, miền đông Ấn Độ, Sri Lanka, Bangladesh, Miến Điện, Indonesia, Singapore và Brunei. ', NULL, NULL, NULL, NULL, NULL, NULL, 'tepbac.com'),
(3080, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Clariidae', 'Cá Trê', 'FAM_091', 'Clarias', NULL, 'GEN_0425', 'clariasfuscus', 'Clarias fuscus', '(Lacepède, 1803)            ', 'Cá trê', 'SPA_03093', 'có thân hình thon dài; một vây lưng có tia mềm kéo dài đến hoặc gần đến gốc vây đuôi; một vây hậu môn có tia mềm kéo dài từ ngay sau hậu môn đến gốc vây đuôi; mỗi vây ngực có một gai xương phía trước có răng cưa; đầu lõm xuống, được bao phủ phần lớn bằng các tấm xương được khâu chắc chắn, bề mặt tạo thành một chiếc mũ bảo vệ; bốn cặp râu hình roi (mũi, hàm trên, hàm dưới bên trong và bên ngoài); cơ quan thở không khí có nguồn gốc từ biểu mô thứ 2 và thứ 4 trong khoang siêu cánh. Nổi bật ở chỗ có 55-63 tia vây lưng và 39-46 tia vây hậu môn. Nhú sinh dục, nằm ở bên phải hậu môn khi bạn nhìn cá với đầu quay sang trái, thon dài và nhọn ở con đực trong khi nó tròn và tương đối lớn hơn (và lớn hơn hậu môn) ở con cái. Đặc biệt khi nhìn từ phía bụng, con cái có thân hình rộng hơn nhiều so với con đực ở cùng độ tuổi và cách nuôi dưỡng. Ăn tạp và săn mồi. Sẽ ăn hầu như bất cứ thứ gì có thể được coi là ăn được. ', NULL, ' Trung Quốc, Đài Loan, Philippines và Việt Nam, Hawaii.', NULL, NULL, NULL, NULL, NULL, NULL, 'Planetcatfish'),
(3081, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Clariidae', 'Cá Trê', 'FAM_091', 'Clarias', NULL, 'GEN_0425', 'clariasgarienpinus', 'Clarias garienpinus', '(Burchell, 1882)', 'Cá Trê phi', 'SPA_03094', 'Nó sống về đêm như nhiều loài cá da trơn khác. Nó ăn động vật sống, cũng như đã chết. Với cái miệng rộng của nó, nó có thể nuốt chửng cả con mồi tương đối lớn. Nó đã được biết đến đã ăn nhiều loài chim nước như Gallinula chloropus. Nó cũng có thể trườn trên mặt đất khô để thoát khỏi hồ bơi khô. Hơn nữa, nó có thể để tồn tại trong bùn nông trong thời gian dài của thời gian, giữa mùa mưa', NULL, 'Chúng được tìm thấy khắp Châu Phi và Trung Đông, chúng sống nước ngọt tại các hồ, sông, và đầm lầy, cũng như môi trường sống của con người tạo ra, chẳng hạn như ao có quá trình oxy hóa hoặc các cống của hệ thống xử lý nước thải tại đô thị. Cá trê trắng châu Phi đã được giới thiệu trên toàn thế giới vào những năm 1980 nhằm mục đích nuôi trồng thủy sản, do đó được tìm thấy ở các nước xa bên ngoài môi trường sống tự nhiên của chúng, chẳng hạn như Brazil, Việt Nam, Indonesia và Ấn Độ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/C%C3%A1_tr%C3%AA_phi'),
(3082, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Clariidae', 'Cá Trê', 'FAM_091', 'Clarias', NULL, 'GEN_0425', 'clariasmacrocephalus', 'Clarias macrocephalus', 'Gunther, 1864', 'cá trê vàng', 'SPA_03095', 'Thân thon dài, dẹp dần về phía đuôi. Đầu to, rộng, dẹp đứng. Xương gốc có chẩm hình tròn. Miệng to, mắt nhỏ. Khoảng cách hai ổ mắt rộng. Răng xương lá mía là một dải hình lưỡi liềm. Có 4 đôi râu, dài gần đến gốc hoặc quá gốc vây ngực.\nVây lưng và vây hậu môn dài, không có gai cứng và không liền với vây đuôi. Vây bụng nhỏ. Vây ngực có một gai cứng mang răng cưa ở mặt sau. Vây đuôi tròn. Lưng và đỉnh đầu màu đen, bụng vàng nhạt. Hai bên thân có những chấm trắng tạo thành các hàng thẳng đứng. Vây có màu đen, điểm các đốm thẫm.\n\nNgoài tự nhiên cá có thể đạt đến chiều dài 120cm.', NULL, 'Cá trê vàng được tìm thấy ở các nước nhiệt đới châu Á như Thái Lan, Việt Nam, Trung Quốc, Malaysia, Guam và Philippines', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3083, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Clariidae', 'Cá Trê', 'FAM_091', 'Clarias', NULL, 'GEN_0425', 'clariasmeladerma', 'Clarias meladerma', 'Bleeker, 1846', 'Trê đen ', 'SPA_03096', 'Thân cá trên đen dài, có da trần nhẵn, bóng. Đầu dẹt bằng, thân và đuôi dẹt bên, mang cá là một bộ phận đặc biệt gọi là hoa khế làm cho cá có thể sống trên cạn được lâu. Miệng rộng, hướng ra phía trước, có răng sắc nhọn, có 4 đôi râu dài, mắt nhỏ, lỗ mũi cách nhau khá xa. Vây lưng và vây hậu môn rất dài, các tia vây gần bằng nhau, vây đuôi tròn, vây ngực có tia gai ngắn, cứng, khía răng cưa, vây bụng nhỏ.\n\nMàu sắc của cá là màu đen hoặc nâu đen, bụng nhạt hơn. Trong thịt cá trê chứa 16,5% protid, 11,9% lipid, 20 mg% Ca, 21 mg% P, 1 mg% Fe, 0,1 mg% vitamin B1, 0,04 mg% B2, 1,4 mg%PP và cung cấp 178 calo trong 100g thịt. Thịt cá trê đen có vị ngọt, tính bình, không độc, có tác dụng bổ huyết, giảm đau, sinh tân, ích khí.', NULL, NULL, NULL, NULL, 'Thịt cá trê om hay hầm là món ăn và vị thuốc rất tốt cho cơ thể đang suy yếu, người mới ốm khỏi. Cá trê giã nhỏ với lá cỏ xước, rồi nấu với lá vông nem, ăn cả cái lẫn nước chữa sa dạ con; với than quả bồ kết (0,5-1g) lại chữa viêm phế quản. Thuốc giải độc có cá trê (1 con) làm thịt, bỏ ruột, lấy chu sa đã thủy phi, tán bột mịn (1g) rắc đều vào cá, nướng chín. Ăn với ít muối hoặc nước mắm làm 3-4 lần trong ngày. Cách thủy phi chu sa: mài chu sa vào bát sứ. Dùng nam châm hút hết mùn sắt. Cho nước vào, khuấy đều, để lắng. Gạn bỏ nước trong. Lại thêm nước, khuấy đều. Lấy cặn gói vào giấy màu đen, phơi nắng đến khô.', NULL, NULL, NULL, NULL),
(3084, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Pangasiidae', 'Cá Tra', 'FAM_271', 'Helicophagus', NULL, 'GEN_0834', 'helicophaguswaandersi', 'Helicophagus waandersi', 'Bleeker, 1858', 'Cá Tra chuột', 'SPA_03097', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3085, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Pangasiidae', 'Cá Tra', 'FAM_271', 'Pangasius', NULL, 'GEN_1431', 'pangasiusbocourti', 'Pangasius  bocourti  ', 'Sauvage, 1880', 'Cá Ba sa', 'SPA_03098', 'Thân dẹp vừa phải, đầu dẹp bằng, trán rộng. Răng nhỏ mịn. Răng khẩu cái hình tam giác nằm kề 2 bên đám răng lá mía và 2 đám răng này nhỏ hơn 1/3 răng lá mía. Râu mép kép dài tới hoặc quá gốc vây ngực, râu hàm dưới nhỏ mịn kéo dài đến khoảng giữa mắt và điểm cuối nắp mang. Mắt to nằm trên đường thẳng ngang kẻ từ góc miệng gần chót mõm hơn gần điểm cuối nắp mang. Lỗ thóp không rõ ràng. Bụng to tròn, phần sau thân dẹp bên. Cuống đuôi thon dài. Đường lưng thẳng dốc từ chót mõm đến khởi điểm gốc vây lưng. Gai vây lưng và gai vây ngực cứng, nhọn, mặt sau của các gai này có răng cưa hướng xuống gốc. Vây mỡ nhỏ, dài, phần sau không dính với cuống đuôi. Mặt sau của thân và đầu có màu xám xanh, nhạt dần xuống bụng, bụng có màu trắng bạc. Vây lưng, vây ngực có màu xám, vây hậu môn có màu trắng trong, màng da giữa các tia vây đuôi có màu đen nhạt. Cá có thể sống ở thủy vưc nước chảy và hồ lớn, thích hợp với nhiệt độ ấm (26 – 32 0C), chịu đựng được hàm lượng oxygen dao động từ 3 – 6 mg/l, pH từ 7 – 8.2. Lưu tốc dòng chảy ở bè nuôi phải luôn nằm trong giới hạn từ 0.2 - 0.3 m/s.\nCá ăn tạp thiên về động vật. Thức ăn cá bao gồm: cá con, giun, ốc, côn trùng, cám, rau, bèo, phụ phẩm nông nghiệp và thức ăn chế biến. Cá lớn nhanh, cá nuôi bè sau 1 chu kỳ nuôi 6 tháng, trọng lượng cá có thể đạt dao động từ 800 gram - 1000 gram/con, và sau 1 năm, trọng lượng cá đạt trung bình 1.2 kg - 1.5 kg/con.\nMùa vụ sinh sản chính của cá basa thường tập trung vào tháng 2 - 4 và đỉnh cao là tháng 3 hằng năm. Sức sinh sản của cá Basa dao động bình quân từ 5.000 - 10.000 trứng/kg cá cái, trong đó đường kính trứng của cá thông thường đạt 1.9 - 2.1 mm.', NULL, 'ở Việt Nam gặp nhiều ở khu vực đồng bằng sông Cửu Long. Là loài cá nuôi. Ấn Độ, Myanma, Thái Lan, Giava, Campuchia', NULL, NULL, NULL, NULL, NULL, NULL, 'tepbac'),
(3086, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Pangasiidae', 'Cá Tra', 'FAM_271', 'Pangasius', NULL, 'GEN_1431', 'pangasiushypophthalmus', 'Pangasius hypophthalmus', '(Sauvage, 1878)', 'Cá Tra ', 'SPA_03099', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3087, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Plotosidae', 'Cá Ngát', 'FAM_297', 'Plotosus', NULL, 'GEN_1592', 'plotosuscanius', 'Plotosus canius', 'F. Hamilton, 1822', 'Cá ngát đen, cá ngát chó, cá làu, cá trê biển', 'SPA_03100', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3088, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Schilbeidae', 'Cá Tra', 'FAM_332', 'Laides', NULL, 'GEN_1014', 'laideshexanema', 'Laides hexanema', '(Bleeker, 1852)', '', 'SPA_03101', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3089, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Schilbeidae', 'Cá Tra', 'FAM_332', 'Pseudolais', NULL, 'GEN_1657', 'pseudolaismicronemus', 'Pseudolais micronemus', '(Bleeker, 1846)', 'cá tra nuôi', 'SPA_03102', 'Mắt lớn, đường kính gấp 4-5 lần chiều dài đầu (ở mẫu vật dài 18 cm); vây đuôi màu xám đen; râu hàm trên hiếm khi kéo dài qua mắt và không bao giờ qua mắt. hàm dưới có đường viền góc cạnh chứ không tròn trịa. Con cái có thân hình đầy đặn hơn. Ăn tạp,', NULL, ' lưu vực sông Mê Kông, sông Huế, bán đảo Mã Lai và Indonesia, bao gồm Sumatra, Java và Borneo. Đặc biệt phân bố rộng rãi ở Borneo', NULL, NULL, NULL, NULL, NULL, NULL, 'planetcatfish'),
(3090, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Schilbeidae', 'Cá Tra', 'FAM_332', 'Pseudolais', NULL, 'GEN_1657', 'pseudolaispleurotaenia', 'Pseudolais pleurotaenia', '(Sauvage, 1878)', 'cá sát bay', 'SPA_03103', 'Gai lưng: 1; Tia lưng mềm: 7; Tia hậu môn mềm: 39 - 46. Bụng có sống giữa phát triển tốt kéo dài từ họng đến gốc vây hậu môn. Vây lưng tiến về vị trí, có gai cứng có răng cưa; gai ngực dài bằng hoặc dài hơn gai lưng một chút, khỏe, có răng dọc theo mép trong; đầu xương chậu nhỏ; vây hậu môn thấp, dài; vây mỡ rất nhỏ. Mảng răng đơn, hình bầu dục ở mỗi bên vòm miệng; mắt to Được tìm thấy ở các thác ghềnh và ở những đoạn sâu hơn, chậm hơn. Phổ biến ở trung lưu sông Mê Kông trước mùa lũ, nơi nó được tìm thấy ở hạ lưu các dòng nhánh cùng với hầu hết các loài cá chép được tìm thấy ở dòng chính sông Mê Kông khi nước trong. Ăn côn trùng trên cạn và dưới nước cùng với một lượng nhỏ thực vật. ', NULL, ' lưu vực sông Mê Kông, Chao Phraya, Meklong và Tapi.', NULL, NULL, NULL, NULL, NULL, NULL, 'fishbase'),
(3091, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Siluridae', 'Cá Nheo', 'FAM_343', 'Belodontichthys', NULL, 'GEN_0216', 'belodontichthystruncatus', 'Belodontichthys truncatus', 'Kottelat & Ng, 1999', 'Cá Trèn trunca (cá Leo – tên Địa phương)', 'SPA_03104', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3092, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Siluridae', 'Cá Nheo', 'FAM_343', 'Kryptopterus', NULL, 'GEN_1003', 'kryptopteruscheveyi', 'Kryptopterus cheveyi', 'Durand, 1940', 'Cá Trèn lá', 'SPA_03105', 'Gai lưng (tổng cộng): 0; Tia mềm vùng lưng (tổng): 0; Tia mềm hậu môn : 66 - 71. Không có vây lưng; râu hàm trên và hàm dưới ngắn dài tới gốc vây ngực; Tia hậu môn 66-71 (Tham khảo 27732 ). nhô hàm dưới và thân nông (độ sâu 4,0-4,9 ở SL); chiều dài đầu 5,6-5,8 lần ở SL; một mảng răng vomerine; lược mang 6-8 + 21-23 (Tham khảo 12693 ).', NULL, 'Châu Á: lưu vực sông Mê Kông và Chao Phraya (Tham khảo 27732 ). Được báo cáo từ các hệ thống sông ở Đông Nam Thái Lan ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://fishbase.mnhn.fr/summary/26722'),
(3093, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Siluridae', 'Cá Nheo', 'FAM_343', 'Kryptopterus', NULL, 'GEN_1003', 'kryptopteruslimpok', 'Kryptopterus limpok', '(Bleeker, 1852)', '', 'SPA_03106', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3094, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Siluridae', 'Cá Nheo', 'FAM_343', 'Micronema', NULL, 'GEN_1222', 'micronemamicronema', 'Micronema micronema', '(Bleeker, 1846)', '', 'SPA_03107', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3095, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Siluridae', 'Cá Nheo', 'FAM_343', 'Micronema', NULL, 'GEN_1222', 'micronemamoorei', 'Micronema moorei', '(Smith, 1945)', 'cá trèn mỡ', 'SPA_03108', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3096, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Siluridae', 'Cá Nheo', 'FAM_343', 'Ompok', NULL, 'GEN_1369', 'ompokbimaculatus', 'Ompok bimaculatus', '(Bloch, 1794)', 'cá trèn bầu', 'SPA_03109', 'Thân dài, dẹp bên. Đầu ngắn, rộng, dẹp bằng, nhìn từ trên xuống mõm có dạng hình vuông. Răng hàm nhỏ, nhọn, kích thước không đều nhau, xếp thành nhiều hàng và ngọn răng hướng vào xoang miệng.\n Cá có 2 đôi râu: Râu hàm trên dài đến đến góc vây ngực có khi chạy đến khởi điểm vây hậu môn\nRâu hàm dưới nhỏ khoảng bằng đường kính mắt.\nLỗ mang to, màng mang phát triển và không dính với eo mang. Vây lưng nhỏ nằm lệch về phía đầu. Cơ gốc vây ngực khá phát triển, gai vây ngực cứng, nhọn.\nGốc vây hậu môn rất dài. Vây hậu môn không dính liền với vây đuôi. Vây bụng nhỏ, vây đuôi chẻ hai, rãnh chẻ sâu hơn 1/2 chiều dài vây đuôi. Mặt lưng của thân và đầu màu đen nhạt và nhạt dần xuống mặt bụng, mặt bụng màu trắng, trên thân và đầu ửng lên màu tím pha vàng. Đặc biệt có một đốm tròn màu tím đen nằm sau nắp mang và phía trên vây ngực, gốc vây đuôi có một vệt màu tím nhạt. Cá trèn phân bố vào những vùng nước chảy chậm, ao hồ, kinh, rạch, thậm chí chúng còn vào đồng, nhờ những mùa nước nổi. Cá Trèn bầu là loài cá dữ, trong tự nhiên thức ăn của cá có nguồn gốc từ động vật, cá có tập tính bắt mồi chủ động. Cá Trèn bầu có sức sinh sản sản tuyệt đối dao động lớn 2.714 22.746 trứng/cá cái, sức sinh sản tương đối trong khoảng 126 – 501 trứng/g. Đường kính trứng dao động trong khoảng 1,18mm – 1,34mm. cá có tập tính di cư sinh sản. Cá đẻ chủ yếu vào mùa mưa, cá có hệ số thành thục cao vào các tháng 6, 7, 8. ', NULL, 'đồng bằng sông Cửu Long Việt Nam. Cá Trèn bầu là loài cá bản địa ở châu Á, phân bố ở Indonesia, Malaixia, Thái Lan, Myanma, Ấn Độ, Lào, Campuchia', NULL, NULL, NULL, NULL, NULL, NULL, 'tepbac'),
(3097, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Siluridae', 'Cá Nheo', 'FAM_343', 'Ompok', NULL, 'GEN_1369', 'ompokhypophthalmus', 'Ompok hypophthalmus', '(Bleeker, 1846)', 'Cá Trèn mắt', 'SPA_03110', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3098, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Siluridae', 'Cá Nheo', 'FAM_343', 'Ompok', NULL, 'GEN_1369', 'ompokmiostoma', 'Ompok miostoma', '(Vaillant, 1902)', 'Cá sơn đài', 'SPA_03111', 'Cá cỡ lớn, thân dài, dẹt bên. Viền lưng cong và gãy khúc ở cuối đầu. Đầu lớn và dẹp đứng. Mắt nhỏ. Miệng rộng, rạch miệng xiên, hàm dưới nhô ra và hướng lên trên. Khe mang lớn, nắp mang rất dày. Có hai đôi râu: râu hàm trên kéo dài quá khởi điểm vây hậu môn, râu hàm dưới ngắn. Vây ngực phát triển hơn vây lưng và vây bụng. Vây hậu môn rất dài không nối với vây đuôi. Thân và các vây có màu đen xám hoặc đen loang lỗ, nhạt dần về phía bụng.', NULL, 'Trung, thượng lưu sông Sài Gòn, sông Đồng Nai, Đông Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=6&loai=1&ID=6139'),
(3099, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Siluridae', 'Cá Nheo', 'FAM_343', 'Parasilurus', NULL, 'GEN_1464', 'parasilurusasotus', 'Parasilurus asostus', 'Linnaeus, 1758', 'Cá Nheo', 'SPA_03112', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3100, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Siluridae', 'Cá Nheo', 'FAM_343', 'Parasilurus', NULL, 'GEN_1464', 'parasiluruscochinchinensis', 'Parasilurus cochinchinensis', '(Valenciennes, 1840)', NULL, 'SPA_03114', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3101, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Siluridae', 'Cá Nheo', 'FAM_343', 'Phalacronotus', NULL, 'GEN_1516', 'phalacronotusbleekeri', 'Phalacronotus bleekeri', '(Günther, 1864)', 'cá trèn', 'SPA_03115', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3102, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Siluridae', 'Cá Nheo', 'FAM_343', 'Pterocryptis', NULL, 'GEN_1676', 'pterocryptiscochinchinensis', 'Pterocryptis cochinchinensis', '(Valenciennes, 1840)', 'Cá thèo', 'SPA_03116', 'có vây lưng nhỏ, hàm trên dài hơn hàm dưới và vây hậu môn và vây đuôi hợp lại với một rãnh rõ rệt giữa chúng.  Dễ dàng phân biệt bằng đầu cùn và vây đuôi cụt. Con đực có một nhú sinh dục hình nón nhỏ trong khi con cái có một nhú lớn, dẹt, giống như chiếc lá. Con đực cũng có những đường răng cưa chắc chắn ở mép sau của gai ngực mà con cái không có. Dễ dàng ăn thực phẩm sống/đông lạnh và các thực phẩm chế biến sẵn khác như thức ăn viên. Có thể ăn những loài cá rất nhỏ', NULL, 'Vùng viển miền Trung Việt Nam Châu Á: Lưu vực Nam Xam ở Lào, Việt Nam, Đông Nam Trung Quốc và Thái Lan.', NULL, NULL, NULL, NULL, NULL, NULL, 'Planetcatfish'),
(3103, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Siluridae', 'Cá Nheo', 'FAM_343', 'Pterocryptis', NULL, 'GEN_1676', 'pterocryptiscucphuongensis', 'Pterocryptis cucphuongensis', '(Mai, 1978)', 'Cá niết cúc phương', 'SPA_03117', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3104, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Siluridae', 'Cá Nheo', 'FAM_343', 'Silurus', NULL, 'GEN_1820', 'silurusasotus', 'Silurus asotus', 'Linnaeus, 1758', 'Cá nheo', 'SPA_03118', 'Thân hình trụ, thon dài. 2 đôi râu ( hàm dưới và hàm trên). Vây lưng nhỏ, vây hậu môn nối với vây đuôi. Lưng màu nâu sẫm đến nâu vàng lục, bụng màu vàng nhạt đến trắng vàng. Kích thước trung bình của người trưởng thành là khoảng 300 ~ 500mm. Cá con có cặp râu hàm dưới thứ hai tự rụng khi cá đạt chiều dài 60-70 mm  chúng ăn cá nhỏ hơn, động vật giáp xác và côn trùng. Sinh sản vào tháng 5 đến tháng 7. Trứng hơi dính, màu xanh vàng hoặc xanh lục, hình cầu, đường kính 1,1 - 1,2 mm.', NULL, ' Châu Âu và Châu Á: Honshu, Shikoku và Kyushu ở Nhật Bản, Bán đảo Triều Tiên, Đài Loan, Trung Quốc và Nga.', NULL, NULL, NULL, NULL, NULL, NULL, 'Planetcatfish'),
(3105, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Siluridae', 'Cá Nheo', 'FAM_343', 'Wallago', NULL, 'GEN_2043', 'wallagoleeri', 'Wallago leeri', 'Bleeker, 1851', '', 'SPA_03119', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3106, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Siluridae', 'Cá Nheo', 'FAM_343', 'Wallago', NULL, 'GEN_2043', 'wallagomicropogon', 'Wallago micropogon', 'Ng, 2004', 'Cá Sơn đai', 'SPA_03120', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3107, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Sisoridae', 'Cá Chiên', 'FAM_344', 'Bagarius', NULL, 'GEN_0198', 'bagariusbagarius', 'Bagarius bagarius', '(Hamilton, 1822)', 'Cá chiên', 'SPA_03121', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3108, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Sisoridae', 'Cá Chiên', 'FAM_344', 'Bagarius', NULL, 'GEN_0198', 'bagariusrutilus', 'Bagarius rutilus', 'Ng et Kottelat, 2000', 'Cá chiên', 'SPA_03122', ' da bị sừng hóa nhiều, hộp sọ và dây thần kinh trong được bao phủ bởi nhiều nốt sần lớn, dài, trên chẩm và trong thần kinh không có các đường gờ sắc nét, da phía trên các gai thần kinh trước và sau vây mỡ không bao giờ hình thành các đường gờ rõ rệt, gai thần kinh thon dài, mắt hình elip, chiều sâu thân đến hậu môn 11,0-12,3 %SL, chiều rộng đầu 20,3-21,7 %SL, chiều dài mõm 51,4-54,7 %HL, đường kính mắt 4,1-8,1 %HL; 12-13 tia vây ngực; vây đuôi có 8-9 tia; 23-24 đốt sống trước hậu môn; vây mỡ có gốc ngắn và rìa lưng góc cạnh; màu vàng đậm ở mặt lưng và mặt bên của đầu và thân, vùng bụng nhạt dần sang màu vàng nhạt; mặt lưng của đầu và thân có ba dải hoặc đốm màu sẫm (nâu); một vài đốm nhỏ màu nâu phân bố không đều khắp các phần sáng hơn của cơ thể; vây màu vàng nhạt có các đốm nhỏ màu nâu phân bố không đều, màu cam khi sống. Nguồn gốc mỡ ở phía trước hoặc phía trên nguồn gốc vây hậu môn; đường kính dọc mắt 12-24 lần tính bằng HL. Thức ăn của ấu trùng như giun huyết và cả tôm. có thể cho ăn miếng lớn hơn (bao gồm cả cá) khi cá lớn lên.  Nó là loài săn mồi thực sự xuất sắc, thường săn mồi theo nhóm. Trong điều kiện nuôi nhốt, thể hiện hành vi rất chống đối xã hội, vì vậy hãy hết sức cẩn thận với những loài cá (lớn) khác vì theo báo cáo, chúng ăn vảy và các bộ phận vây của một số loài cá lớn được nuôi cùng với nó. Sẽ ăn bất cứ thứ gì nhỏ hơn.', NULL, ' Lưu vực Nam Xâm và Nam Mã ở Lào và lưu vực sông Hồng ở Việt Nam và Vân Nam, Trung Quốc.', NULL, NULL, NULL, 'VU', NULL, NULL, 'Planetcatfish'),
(3109, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Sisoridae', 'Cá Chiên', 'FAM_344', 'Bagarius', NULL, 'GEN_0198', 'bagariusyarrelli', 'Bagarius yarrelli', '(Sykes, 1838)', 'cá chiên', 'SPA_03123', 'L (chiều dài tổng cộng) = 100 - 350 mm. Lo (chiều dài chuẩn) = 75 - 280 mm. D (số tia vây lưng) = 1/6. A (số tia vây hậu môn) = 11. P (số tia vây ngược) = 1/11. V (số tia vây bụng) = 7. H/Lo (chiều cao lớn nhất của thân/chiều dài chuẩn) = 16,6. T/Lo (chiều dài đầu/chiều dài chuẩn) = 33,5. O/T (đường kính ổ mắt/chiều dài đầu) = 9,2. OO/T (khoảng cách 2 ổ mắt/chiều dài đầu) = 29,3.\nThân hình trụ, thon dần về phía đuôi. Đầu rộng và rất dẹp dứng. Mặt dưới của đầu và bụng phẳng. Miệng rộng hình lưỡi liềm, hàm trên hơi nhô ra. Khe mang rất rộng và kéo dài xuống tận mặt bụng. Mắt nhỏ có nếp da che phủ, khoảng cách hai ổ mắt hẹp. Mắt nằm gần đỉnh đầu. Hai lỗ mũi nằm gần nhau và ngắn cách bởi râu mũi. Có 4 đôi râu, râu mũi rất ngắn, râu hàm trên phát triển thành phến rộng và cứng, râu hàm dưới và râu cằm ngắn.\nVây lưng có gai nhưng không mang răng cưa. Vây ngực rất phát triển, có gai cứng mang răng cưa ở mặt sau. Vây mỡ ngắn và đối xứng với vây hậu môn. Vây đuôi phân thùy sâu và nhọn.\nCá có nền thân màu nâu hoặc màu nâu đậm, phần bụng trắng. Lưng, hông và các vây có những vân hoặc dãy nâu thẫm và các chấm đen. Miền Nam loài này phân bố cả trên sông Đồng Nai, sông Sài Gòn và hạ lưu sông Cửu Long, nhưng ít gặp.\nCá thuộc vào loài cá dữ, ăn cá con và các động vật khác như: tôm, tép, ếch nhái. Nhiều tài liệu cho biết kích thước tối đa có thể đến 1 m chiều dài, nhưng mẫu thu được ở đây thường nhỏ. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3110, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Sisoridae', 'Cá Chiên', 'FAM_344', 'Eoxostoma', NULL, 'GEN_0656', 'eoxostomamyzostoma', 'Eoxostoma myzostoma', '(Norman, 1923)', 'Cá Chiên miệng ngoài hút', 'SPA_03124', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3111, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SILURIFORMES', 'CÁ NHEO', 'ORD_079', 'Sisoridae', 'Cá Chiên', 'FAM_344', 'Glyptosternon', NULL, 'GEN_0769', 'glyptosternonhainanensis', 'Glyptosternon hainanensis', 'Nichols & Pope, 1927.', 'Cá chiên suối ', 'SPA_03125', 'Các thành viên của chi này thích nghi để bám vào đá và tảng đá chống lại dòng chảy mạnh nhờ một thiết bị kết dính ở ngực bao gồm các rãnh và nếp gấp của da song song hoặc xiên với trục dọc của cơ thể.  Đầu dẹt, mõm tròn. Đôi mắt nhỏ nằm ở giữa đầu. Râu hàm trên dài tới vây ngực, râu mũi ngắn chỉ dài tới mắt. Thân trần, không có vảy, đường bên thẳng. Màu vàng ở ngực và dạ dày. Ba đốm đen trên cơ thể, một ở dưới vây lưng, một ở dưới vây mỡ và một ở gần gốc vây đuôi. ', NULL, ' Trung Quốc.', NULL, NULL, NULL, NULL, NULL, NULL, 'Planetcatfish'),
