(3121, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'SYNBRANCHIFORMES', 'LƯƠN', 'ORD_088', 'Synbranchidae', 'Lươn', 'FAM_359', 'Monopterus', NULL, 'GEN_1249', 'monopterusalbus', 'Monopterus albus', '(Zuiew, 1793)            ', 'Lươn đồng', 'SPA_03135', 'Chiều dài thân trung bình khoảng 25–40 cm, mặc dù có cá thể dài tới 1 m. Thân hình trụ, da trần không vảy, thiếu vây chẵn, vây lưng nối liền với vây đuôi, vây hậu môn. Các vây không có gai, mang thoái hóa thành một lỗ phía dưới đầu. Đuôi vót nhọn. Lưng màu nâu, bụng màu trắng hay nâu nhạt. Miệng lớn, có thể kéo dài ra được, cả hai hàm đều có các răng nhỏ để ăn cá, giun, giáp xác cùng các động vật thủy sinh nhỏ khác vào ban đêm. Hai mắt rất nhỏ.\n\nGiống như các loài khác trong bộ Lươn, chúng hô hấp nhờ các màng của khoang bụng và ruột, không có bong bóng. Mặc dù nó có thể sống sót ở nhiệt độ dưới điểm đóng băng của nước (0°C) hay vài tháng mà không có nhiều nước hoặc nước lợ/mặn; nhưng nói chung chỉ tìm thấy tại tầng đáy trong các khu vực nước ngọt và ấm áp, chẳng hạn như các ao nhiều bùn, đầm lầy, kênh mương và ruộng lúa.', NULL, ' bản địa của Trung và Nam Mỹ, châu Phi, Australia và từ Ấn Độ tới miền đông châu Á. Tại Hoa Kỳ, người ta thông báo nó có tại các khu vực như Hawaii, Florida và Georgia.', NULL, NULL, NULL, NULL, NULL, NULL, 'Tepba'),
