(3128, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'ACTINOPTERYGII', 'CÁ VÂY TIA', 'CLA_01', 'TETRAODONTIFORMES', 'CÁ NÓC', 'ORD_092', 'Tetraodontidae', 'Cá Nóc', 'FAM_370', 'Tetraodon', NULL, 'GEN_1939', 'tetraodonfluviatilis', 'Tetraodon fluviatilis', '(F. Hamilton, 1822)', 'Cá nóc da beo, cá nóc xanh ', 'SPA_03142', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3129, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Bufonidae', 'Cóc', 'FAM_052', 'Bufo', NULL, 'GEN_0260', 'bufogaleatus', 'Bufo galeatus', 'Gunther, 1864.', 'Cóc rừng', 'SPA_03143', 'Trên đầu có mào xương lớn kéo dài ra phía sau lên trên ổ mắt. Tuyến mang tai nhô rõ. Gờ ổ mắt - màng nhĩ dày, rất phát triển. Màng nhĩ nổi rõ bằng 3/4 mắt. Da xù xì, các mụn cóc chạy dọc thân ở hai bên sườn tạo thành những hàng gai. Dài thân 65 - 85mm Sống chủ yếu ở rừng thường xanh, rừng lẫn rụng lá hay thứ sinh với nhiều tre nứa (ở độ cao 600 - 1200m), trên thảm lá cây mục nát ven các suối nhỏ. Hoạt động kiếm ăn cả ban ngày và ban đêm. Thức ăn chủ yếu của cóc rừng là kiến', NULL, 'Thái Nguyên (Bình Dân), Vĩnh Phúc (Tam Đảo), Thanh Hoá (Bến En), Nghệ An, Hà Tĩnh (Hương Sơn), Quảng Bình (Phong Nha), Gia Lai (Sơklang), Kontum (Ngọc Linh), Lâm Đồng (D\`ran), Đồng Nai (Cát Tiên) Lào, Cămpuchia', NULL, NULL, 'Có giá trị nghiên cứu khoa học, thẩm mỹ, giúp cân bằng sinh thái trong tự nhiên', 'VU B1 + 2a,b,c,d.', 'LC', NULL, 'VnCreature'),
(3130, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Bufonidae', 'Cóc', 'FAM_052', 'Bufo', NULL, 'GEN_0260', 'bufomacrotic', 'Bufo macrotic', 'Boulenger, 1887', 'Cóc rừng nhỏ', 'SPA_03144', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3131, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Bufonidae', 'Cóc', 'FAM_052', 'Bufo', NULL, 'GEN_0260', 'bufomelanostictus', 'Bufo melanostictus', 'Shneider.', 'Cóc nhà', 'SPA_03145', 'Con trưởng thành loài này dài 2 cm', NULL, 'là một loài cóc phổ biến ở Nam Á và Đông Nam Á', NULL, NULL, NULL, NULL, 'LC', NULL, 'https://vi.wikipedia.org/wiki/C%C3%B3c_nh%C3%A0'),
(3132, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Bufonidae', 'Cóc', 'FAM_052', 'Bufo', NULL, 'GEN_0260', 'bufopageoti', 'Bufo pageoti', 'Bourret, 1937', 'Cóc Pagio', 'SPA_03146', 'Loài cóc có kích thước trung bình 45 mm. Toàn thân nâu vàng với vài nốt đen sẫm ở phần đầu nhất là một nốt đen hình V ngược nằm ở khoảng giữa hai tuyến mang tai. Da ráp, sần sùi với nhiều mụn tròn nhỏ rải rác khắp trên lưng và các chi. Bụng có mầu sáng hơn lưng với nhiều lấm tấm đen kể cả dưới đùi và cánh tay. Đầu nhỏ, gờ mõm rõ, không có gờ sương trên sọ, có tuyến mang tai. Khoảng giữa hai mắt phẳng, rộng hơn mí mắt trên. Màng nhĩ rõ, bằng 3/4 đường kính mắt. Chân tay mảnh, đầu các ngón tròn, không phình thành đĩa. Hai củ dưới bàn tay và bàn chân rõ, mầu vàng sáng.\nSinh học, sinh thái:\nĐây là loài cóc ưa sống ở các vùng rừng nguyên sinh, ẩm, kín tán với độ cao trên 300m chủ yếu ven các suối nước.', NULL, 'Trong nước: Lào Cai (Sa Pa), Hà Tĩnh (Hương Sơn), Quảng Nam (Trà My)\nThế giới: Chỉ có ở Việt Nam.', NULL, NULL, 'Có giá trị khoa hoc. Từ 1937 cho đến vài năm gần đây (1999 - 2000) mới có thêm thông tin về loài này.', 'EN B1b + 2b,c,d.', NULL, NULL, 'https://vncreatures.net/chitiet.php?page=7&loai=1&ID=6108'),
(3133, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Bufonidae', 'Cóc', 'FAM_052', 'Duttaphrynus', NULL, 'GEN_0619', 'duttaphrynusmelanostictus', 'Duttaphrynus melanostictus', '(Schneider, 1799            ', 'Cóc nhà', 'SPA_03147', 'Đặc điểm nhận dạng:\n\nMẫu vật nghiên cứu: Cá thể đực trưởng thành TYT 2012.37 (SVL 64,38 mm). Mõm tròn, nhô về phía trước so với hàm dưới; gờ mõm rõ, vùng má xiên; vùng giữa 2 ổ mắt lõm; khoảng cách gian ổ mắt bằng khoảng 1,5 lần chiều rộng mí mắt trên (IOD 7,69 mm; UEW 5,01 mm); gờ mõm và gờ sọ rõ; gờ sau ổ mắt và gờ ổ mắt-màng nhĩ rõ; tuyến mang tai rất phát triển; mắt lớn; lỗ mũi tròn, nằm gần mút mõm hơn so với mắt; màng nhĩ rõ, đường kính màng nhĩ bằng khoảng 2/3 lần đường kính mắt (TD 5,12 mm, ED 7,06 mm); không có răng lá mía.\n\nChi khỏe, các ngón tay tự do, ngón tay I dài hơn ngón II; ngón chân khoảng 1/3 có màng; củ bàn trong dài hơn củ bàn ngoài; khi gập dọc thân khớp cổ-bàn chạm tới ổ mắt. Trên thân và chi có các mụn to nhỏ không đều, các mụn ở giữa lưng thường lớn hơn và bé dần sang hai bên, đầu các mụn thường đen. Mặt trên thân màu vàng sẫm, đôi khi xám nhạt; bụng trắng bẩn với các vệt đen; mút các ngón tay, ngón chân màu đen, các gờ sọ màu xám đến đen.\nSinh học, sinh thái:\n\nCóc sống ở quanh nhà, trên nương bãi quanh bản làng, trong những hốc nhỏ, khô ráo, kín gió có sẵn như khe tường, đống gạch, góc tường, gậm giường. Hang cóc là nơi trú ẩn của cóc về ban ngày và trong mùa đông giá lạnh. Trong hang cóc có thể có 2 - 5 con, đôi khi lên đến 10 con. Lúc khí trời ấm, Cóc nhảy ra đi kiếm ăn từ xẩm tối. Cóc ăn nhiều loại thức ăn như kiến đen, châu chấu, nhện, gián, bọ xít, sâu non, giun đất, cuốn chiếu, chuồn chuồn, ruồi, nhặng, muỗi và các loài bướm đêm.\n\nMùa sinh sản của Cóc thay đổi tuỳ từng vùng, thường là vào tháng 11- 2 đến tháng giêng, có khi sang cả tháng 2, có nơi vào tháng 3 - 4, có nơi vào tháng 5 - 6. Cóc đẻ nhiều lứa trong một năm. Cóc đẻ trứng trong nước ao, chuôm, ruộng hay rãnh nước hoặc bờ suối. Sau 3 ngày, trứng nở thành nòng nọc màu đen. Khi đuôi teo đi và nòng nọc mọc chân thì màu đen biến mất.', NULL, 'Cóc là loài phổ biến ở Trung Quốc, và nhiều nước châu Á khác. Nước ta, cóc sống phổ biến khắp nơi từ Bắc tới Nam.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3134, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Bufonidae', 'Cóc', 'FAM_052', 'Duttaphrynus', NULL, 'GEN_0619', 'duttaphrynuspageoti', 'Duttaphrynus pageoti', '(Bourret, 1937)', 'Cóc pagiô', 'SPA_03148', 'Loài cóc có kích thước trung bình 45 mm. Toàn thân nâu vàng với vài nốt đen sẫm ở phần đầu nhất là một nốt đen hình V ngược nằm ở khoảng giữa hai tuyến mang tai. Da ráp, sần sùi với nhiều mụn tròn nhỏ rải rác khắp trên lưng và các chi. Bụng có mầu sáng hơn lưng với nhiều lấm tấm đen kể cả dưới đùi và cánh tay. Đầu nhỏ, gờ mõm rõ, không có gờ sương trên sọ, có tuyến mang tai. Khoảng giữa hai mắt phẳng, rộng hơn mí mắt trên. Màng nhĩ rõ, bằng 3/4 đường kính mắt. Chân tay mảnh, đầu các ngón tròn, không phình thành đĩa. Hai củ dưới bàn tay và bàn chân rõ, mầu vàng sáng.', NULL, 'Lào Cai (Sa Pa), Hà Tĩnh (Hương Sơn), Quảng Nam (Trà My)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=7&loai=1&ID=6108'),
(3135, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Bufonidae', 'Cóc', 'FAM_052', 'Igerophrunus', NULL, 'GEN_0956', 'igerophrunusgaleatus', 'Igerophrunus galeatus', 'Gunther, 1864.', 'Cóc rừng', 'SPA_03149', 'Trên đầu có mào xương lớn kéo dài ra phía sau lên trên ổ mắt. Tuyến mang tai nhô rõ. Gờ ổ mắt - màng nhĩ dày, rất phát triển. Màng nhĩ nổi rõ bằng 3/4 mắt. Da xù xì, các mụn cóc chạy dọc thân ở hai bên sườn tạo thành những hàng gai. Dài thân 65 - 85mm.\n\nSinh học, sinh thái:\n\nSống chủ yếu ở rừng thường xanh, rừng lẫn rụng lá hay thứ sinh với nhiều tre nứa (ở độ cao 600 - 1200m), trên thảm lá cây mục nát ven các suối nhỏ. Hoạt động kiếm ăn cả ban ngày và ban đêm. Thức ăn chủ yếu của cóc rừng là kiến.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=3&loai=1&ID=5099'),
(3136, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Bufonidae', 'Cóc', 'FAM_052', 'Igerophrunus', NULL, 'GEN_0956', 'igerophrunusmacrotis', 'Igerophrunus macrotis', '(Boulenger, 1887)', 'Cóc rừng nhỏ', 'SPA_03150', 'Loài lưỡng cư có kích thước trung bình, con cái có chiều dài từ mút mõm đến lỗ huyệt 58.7 mm. Đỉnh không có gờ xương. Đầu rộng hơn dài. Rộng đầu 20.3 mm. Dài đầu 18.7 mm. Mõm cụt, lồi, dài hơn đường kính ngang của mắt. Dài mõm 6.6 mm. Đường kính mắt 5.9 mm. Góc mắt tròn. Vùng má lõm. Khoảng cách gian ổ mắt (4.7mm) rộng hơn khoảng cách hai lỗ mũi (4.1 mm). Mũi gần chóp mõm hơn mắt. Khoảng cách mõm mũi 1.7 mm. Mõm mắt 3.6 mm. Đồng tử tròn. Màng nhĩ rõ, đường kính 3.2 mm. Hạch mang tai 11.1 mm. Răng lá mía tiêu biến. Lưỡi tròn hướng ra sau. Chiều dài chân trước 15.4 mm. Chiều dài chân sau 30.1 mm. Ngón chân không có màng,  khác biệt số đo chiều dài giữa các ngón: II<IV<I<II<V<III\n\nThân màu nâu xám hoặc màu ô - liu, với những đốm nâu sẫm không theo quy luật. Có sọc ngang trên môi trên và vết đan chéo trên các chân. Mặt dưới trắng bụi, có đốm sẫm. Cổ con đực có màu nâu. Con đực có túi kêu. Trong suốt mùa sinh sản, con đực có nếp nhăn nheo màu đen ở trên những ngón chân phía trong.\n\nSinh học, sinh thái:\n\nCác c1 thể trưởng thành sống trên cạn, ban ngày ẩn mình dưới lớp thảm mục thực vật hay hang hốc trong rừng, kiếm ăn ban đêm. Loài này kết đôi, giao phối và đẻ trứng dưới các khu vực vũng nước lớn trong rừng vào đầu mùa mưa hàng năm. Thức ăn là các loài côn trùng, bọ cánh cứng sống trong khu vực phân bố.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=6&loai=1&img=1&ID=6079'),
(3137, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Bufonidae', 'Cóc', 'FAM_052', 'Ingerophrynus', NULL, 'GEN_0964', 'ingerophrynusgaleatus', 'Ingerophrynus galeatus', '(Gunther, 1864)            ', 'Cóc rừng', 'SPA_03151', 'Trên đầu có mào xương lớn kéo dài ra phía sau lên trên ổ mắt. Tuyến mang tai nhô rõ. Gờ ổ mắt - màng nhĩ dày, rất phát triển. Màng nhĩ nổi rõ bằng 3/4 mắt. Da xù xì, các mụn cóc chạy dọc thân ở hai bên sườn tạo thành những hàng gai. Dài thân 65 - 85mm. Sống chủ yếu ở rừng thường xanh, rừng lẫn rụng lá hay thứ sinh với nhiều tre nứa (ở độ cao 600 - 1200m), trên thảm lá cây mục nát ven các suối nhỏ. Hoạt động kiếm ăn cả ban ngày và ban đêm. Thức ăn chủ yếu của cóc rừng là kiến.', NULL, 'Thái Nguyên (Bình Dân), Vĩnh Phúc (Tam Đảo), Thanh Hoá (Bến En), Nghệ An, Hà Tĩnh (Hương Sơn), Quảng Bình (Phong Nha), Gia Lai (Sơklang), Kontum (Ngọc Linh), Lâm Đồng (D\`ran), Đồng Nai (Cát Tiên).  Lào, Cămpuchia.', NULL, NULL, 'Có giá trị nghiên cứu khoa học, thẩm mỹ, giúp cân bằng sinh thái trong tự nhiên.', 'VU', NULL, NULL, 'vncreatures.net'),
(3138, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Annandia', NULL, 'GEN_0101', 'annandiadelacouri', 'Annandia delacouri', '(Angel, 1928)', 'ếch vạch ', 'SPA_03152', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3139, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Bombina', NULL, 'GEN_0235', 'bombinamaxima', 'Bombina maxima', '(Boulenger, 1905)', 'Cóc tía', 'SPA_03153', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3140, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Fejervarya', NULL, 'GEN_0713', 'fejervaryacancrivora', 'Fejervarya cancrivora', '(Smith, 1930)', 'Ếch cua ', 'SPA_03154', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3141, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Fejervarya', NULL, 'GEN_0713', 'fejervaryalimnocharis', 'Fejervarya limnocharis', '(Gravenhorst, 1829)            ', 'Ngoé', 'SPA_03155', 'Mõm dài và nhọn, dài hơn so với mắt (SL 8,69 mm, ED 5 mm); gờ mõm tù; vùng má hơi lõm và xiên; lỗ mũi tròn, gần mút mõm hơn mắt; khoảng cách gian mũi rộng hơn khoảng cách gian ổ mắt; đường kính mắt lớn hơn chiều rộng mí mắt trên và khoảng cách gian ổ mắt (ED 5 mm, UEW 4,38 mm, IOD 4,28 mm); màng nhĩ rõ, đường kính màng nhĩ bằng khoảng 2/3 đường kính mắt (TD 3,52 mm); răng lá mía xếp thành 2 hàng hình chữ V; lưỡi dài, xẻ thùy ở phía sau; con đực có 2 túi kêu.\n\nNgón tay hoàn toàn tự do; chân 1/3 có màng bơi; củ bàn trong dài, củ bàn ngoài bé; khi gập dọc thân khớp chày-cổ chạm giữa mắt, khớp cổ-bàn chạm mút mõm. Gờ da trên màng nhĩ rõ, mặt trên lưng có nhiều nếp da ngắn. Màu sắc khá đa dạng ở các cá thể khác nhau. Mặt trên đầu, lưng có màu xanh rêu hay nâu nhạt; giữa hai mắt thường có vệt sẫm hình chữ V nông; giữa sống lưng đôi khi có vệt sáng từ mút mõm tới trước hậu môn, vệt sáng này có khi rộng ở phần trên đầu nhưng hẹp dần về phía sau; bụng và mặt dưới chi trắng; chi sau có các vệt sẫm màu vắt ngang. Thường gặp ở những nơi ẩm ướt trong các khu rừng thường xanh, đồng ruộng, ven suối, vườn cây...Mùa sinh sản thường kéo dài từ tháng 3 đến tháng 6 hoặc muộn hơn tuỳ từng vùng. Ban ngày chúng ẩn náu nơi đất trũng hay những kẽ đất, đến xẩm tối mới nhảy ra kiếm mồi. Chúng nhảy giỏi và có thể nhảy xa khoảng 2m, bơi rất giỏi. Thức ăn chủ yếu của chúng là kiến, mối, côn trùng đất', NULL, 'Khắp nơi từ Bắc đến Nam ở độ cao thấp đến trung bình.  Afghanistan, Pakistan, Ấn Độ, Nêpal, Sri Lanka, Bangladesh, Trung Quốc, Mianma, Lào, Thái Lan, Cambodia, Phillipine, Indonesia, Nhật Bản.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3142, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Hoplobatrachus', NULL, 'GEN_0903', 'hoplobatrachuschinensis', 'Hoplobatrachus chinensis', '(Osbeck, 1765)', 'Ếch đồng', 'SPA_03156', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3143, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Hoplobatrachus', NULL, 'GEN_0903', 'hoplobatrachusrugulosus', 'Hoplobatrachus regulosus', '(Wiegmann, 1834)', 'Ếch đồng', 'SPA_03157', ' Cá thể trưởng thành TYT 212.42. Đầu dài hơn rộng (HL 31,5 mm, HW 28,29 mm); mắt lớn và lồi, đường kính mắt bằng khoảng 2/3 lần chiều dài mõm, lớn hơn gần 2 lần so với khoảng cách gian ổ mắt (ED 8,38 mm, SL 12,87 mm, UEW 4,9 mm); mõm hơi tù, nhô về phía trước so với hàm dưới; gờ mõm không rõ, vùng má lõm và hơi xiên; lỗ mũi nằm gần mút mõm hơn mắt; màng nhĩ rất rõ, bằng khoảng 3/4 lần đường kính mắt (TD 6,57 mm); có răng lá mía, con đực có 2 túi kêu. Mút các ngón tay và ngón chân tù; các ngón tay tự do; các ngón chân có màng bơi hoàn toàn; củ bàn trong dài, không có củ bàn ngoài; củ dưới khớp nhỏ; khi gập dọc thân khớp cổ-bàn chạm mút mõm.Trên lưng có nhiều nếp da gián đoạn; gờ da trên màng nhĩ; lưng, hai bên thân và mặt trên các chi có các nốt sần. Mặt dưới màu trắng đục hay phớt vàng xen những vệt sẫm không đều; chi sau có các vệt ngang, sẫm màu. Loài này rất giống với loài Ếch cua Fejervarya cancrivora chúng chỉ có thể phân biệt vào màng chân. Chân của loài ếch cua có màng bơi rộng và dài hơn tới tận đầu ngón chân.', NULL, 'Việt Nam: Là loài có phân bố rộng khắp cả nước. Thế giới: Lào Cambodia, Trung Quốc, Thái Lan, Malaixia', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=3&loai=1&ID=5934'),
(3144, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Limnonectes', NULL, 'GEN_1083', 'limnonectesbannaensis', 'Limnonectes bannaensis', 'Ye, Fei, ,Xie, and Jiang, 2007        ', 'Ếch nhẽo', 'SPA_03158', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3145, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Limnonectes', NULL, 'GEN_1083', 'limnonectesblythii', 'Limnonectes blythii', '(Boulenger, 1920)', 'Ếch Blythi', 'SPA_03159', 'Limnonectes blythii là loài ếch suối lớn với các cá thể có lỗ thông mõm dài 230 – 260 mm (Boulenger 1920; Taylor 1962). Đầu hình bầu dục của L. blythii hẹp, dài hơn rộng. Lỗ mũi nằm gần đầu mõm hơn mắt và khóe mắt không rõ ràng. Vùng loreal hơi lõm và xiên. Khoảng cách giữa các hốc mắt ngắn hơn chiều dài mí mắt trên. Màng nhĩ trũng sâu, rõ ràng được đặt lùi về phía sau mắt ở một khoảng cách lớn hơn đường kính màng nhĩ (Boulenger 1920; Taylor 1962). Màng nhĩ có kích thước bằng 2/5-3/5 kích thước của mắt (Boulenger 1920). Loài này có nếp gấp trên màng nhĩ bắt đầu ở mép trước của viền mắt, uốn quanh màng nhĩ và kết thúc phía trên cánh tay gần mép trước của miệng (Taylor 1962). Hàm hơi chìm xuống. Các chi có chiều dài vừa phải. Lòng bàn tay có ba củ với hai củ phẳng bên ngoài hơi dính vào nhau. Các củ dưới khớp có kích thước vừa phải. Các ngón tay hơi sưng ở đầu ngón tay. Ngón tay thứ nhất dài hơn ngón thứ hai rất nhiều và ngón thứ ba có nếp da bên rõ rệt (Boulenger 1920; Taylor 1962). Xương chày dài gấp 3 đến 4 lần chiều rộng (Boulenger 1920). Khi ấn vào cơ thể, khớp xương chày sẽ chạm tới lỗ mũi. Củ bàn chân bên trong thon dài, bị nén và dài hơn một nửa chiều dài của ngón chân cái. Không có củ xương bàn chân bên ngoài. Các ngón chân có các nốt sần dưới khớp lớn và có màng hoàn chỉnh - với ngón chân thứ năm có nếp da bên rõ rệt. Đầu ngón chân bị giãn ra (Taylor 1962). Da của L. blythii nhìn chung có vẻ mịn màng nhưng khi kiểm tra kỹ có thể xuất hiện các vết gợn sóng nhỏ, mụn cóc hoặc nốt sần (Boulenger 1920; Taylor 1962). Con đực và con cái có lưỡng hình giới tính. Con đực thiếu túi thanh âm, miếng đệm hôn nhân và cơ gấp cẳng tay (Emerson 1996).', NULL, ' Indonesia, Cộng hòa Dân chủ Nhân dân Lào, Malaysia, Myanmar, Philippines, Singapore, Thái Lan, Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'https://amphibiaweb.org/species/4746'),
(3146, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Limnonectes', NULL, 'GEN_1083', 'limnonectescancrivorus', 'Limnonectes cancrivorus', 'Dubois, 1992', 'Ếch cua', 'SPA_03160', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3147, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Limnonectes', NULL, 'GEN_1083', 'limnonectesdabanus', 'Limnonectes dabanus', 'Smith, 1922', 'Ếch gáy dô ', 'SPA_03161', 'Đặc điểm nhận dạng:\n\nĐỉnh đầu có một phần xương nhô cao rất rõ, đầu rất to, chiều dài hơn chiều rộng (HL 31,5 mm, HW 28,29 mm); mắt lớn và lồi, đường kính mắt bằng khoảng 2/3 lần chiều dài mõm, lớn hơn gần 2 lần so với khoảng cách gian ổ mắt (ED 8,38 mm, SL 12,87 mm, UEW 4,09 mm); mõm hơi tù, nhô về phía trước so với hàm dưới; gờ mõm không rõ, vùng má lõm và hơi xiên; lỗ mũi nằm gần mút mõm hơn mắt; màng nhĩ rất rõ, lớn hơn đường kính mắt (TD 6,57 mm); con đực có 2 túi kêu.\n\nMút các ngón tay và ngón chân tù; các ngón tay tự do; các ngón chân có màng bơi không hoàn toàn; củ bàn trong dài, không có củ bàn ngoài; củ dưới khớp nhỏ; khi gập dọc thân khớp cổ-bàn chạm mút mõm.Trên lưng có nhiều nếp da gián đoạn; gờ da trên màng nhĩ; lưng, hai bên thân và mặt trên các chi có các nốt sần. Mặt dưới màu trắng đục hay phớt vàng xen những vệt sẫm không đều; chi sau có các vệt ngang, sẫm màu.\n\nSinh học, sinh thái:\n\nLoài ếch này khá hiếm gặp và hiện trạng quần thể của chúng trong tự nhiên chưa được nghiên cứu đầy đủ nên trong Danh lục đỏ của IUCN (2007) loài ếch gáy dô được xếp ở bậc DD (thiếu dẫn liệu). Là loài kiếm ăn đêm, ban ngày ẩn nấp. Thức ăn chủ yếu của chúng là các loài côn trùng, giun đất, cua. Vòng đời của chúng cũng như các loài lưỡng cư khác đều biến thái gồm 2 giai đoạn là dưới nước và trên cạn. Ếch cái đẻ trứng ở các vũng nước trong rừng và nòng nọc sẽ sống thành bầy, ăn thực vật, di chuyển bằng đuôi trước khi chuyển qua giai đoạn lên bờ.', NULL, 'Việt Nam: Sinh cảnh sống của chúng là các vũng lầy hoặc ven các suối trong rừng trên núi đất thấp nằm ở độ cao từ 150 - 700m so với mực nước biển. Loài ếch này hiện biết phân bố ở miền Nam Việt Nam (Đăk Lăk, Đăk Nông, Lâm Đồng, Đồng Nai, Kiên Giang). Trong chuyến khảo sát gần đây, chúng tôi đã ghi nhận và chụp ảnh loài ếch gáy dô ở khu vực Mã Đà, Đồng Nai và Vườn quốc gia Bù Gia Mập thuộc tỉnh Bình Phước...\n\nThế giới: Cambodia - (O’ Rang, Pichrada, Siem Pang), Thái Lan.', NULL, NULL, 'Là loài ếch cổ đại còn sót lại từ kỷ phấn trắng. Có giá trị nghiên cứu khoa học về sinh thái và tập tính của loài.', NULL, NULL, NULL, NULL),
(3148, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Limnonectes', NULL, 'GEN_1083', 'limnonecteshascheanus', 'Limnonectes hascheanus', '(Stoliczka, 1870)', 'Ếch hatchê', 'SPA_03162', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3149, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Limnonectes', NULL, 'GEN_1083', 'limnonecteskokchangae', 'Limnonectes kokchangae', '(Smith, 1922)', 'Ếch cốc chang', 'SPA_03163', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3150, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Limnonectes', NULL, 'GEN_1083', 'limnonecteskuhlii', 'Limnonectes kuhlii', '(Tschudi, 1838)            ', 'Êch nhẽo', 'SPA_03164', 'Đầu dài hơn rộng (HL 20,9 mm, HW 19,79 mm); mõm tròn, nhô về phía trước so với hàm dưới; không có gờ mõm, vùng má hơi lõm; lỗ mũi nằm gần mút mõm hơn mắt; khoảng cách gian mũi bằng khoảng 3/4 lần gian ổ mắt (IND 4,36 mm, IOD 6,14 mm); đường kính mắt gấp gần 2 lần chiều rộng mí mắt trên và lớn hơn khoảng cách gian ổ mắt (ED 6,96 mm, UEW 3,56 mm, IOD 6,14 mm); màng nhĩ không rõ; hai bên hàm có mấu hình răng rõ; răng lá mía xếp thành 2 hàng hình chữ V gần chạm nhau ở phía sau; lưỡi xẻ thùy ở phía sau.\n\nCác ngón tay tự do, ngón tay I bằng ngón II, mút các ngón hơi phình; chân ngắn, mập, mút các ngón chân có đĩa rất nhỏ, ngón chân có màng bơi hoàn toàn; củ bàn trong bé, không có củ bàn ngoài; khi gập dọc thân khớp chày-cổ chạm đến mắt. Da trơn, phần sau mi mắt trên và hai bên thân có những nốt sần rất nhỏ, một số cá thể hoàn toàn không có nốt sần. Gờ da trên màng nhĩ rõ, có một nếp da khác ngang qua đầu ở ngay sau ổ mắt. Lưng thường có màu nâu, nâu xám hay có màu đen, trên thân có các đốm sẫm nhỏ; phía sau ổ mắt có hoặc không có vệt sẫm màu; môi thường có 2-3 vệt sẫm. Một số cá thể có sọc vàng dọc giữa lưng. Mặt bụng màu trắng có các vệt nâu ở cằm và ngực. Sống trong các khe, kẽ đá ở suối nước chảy trong rừng sâu ở độ cao từ 200 đến 1.700m. Kiếm ăn ban đêm, thức ăn gồm: cánh cứng, giản rừng, châu chấu, sâu non, cuốn chiếu, gọng vỏ, kiến, cua, giun. Đẻ trứng khoảng tháng 3  đến tháng 6, trứng có màng trong suốt, dường kính 2,5-3mm, số lượng 100-500 quả.', NULL, 'Việt Nam: ở các vùng miền núi trên cả nước. Loài này là nguồn thực phẩm của nhân dân miền núi, tiêu diệt côn trùng có hại. Thế giới: Brunei; Trung Quốc; India; Indonesia; Lao People\`s Democratic Republic; Malaysia; Myanmar; Thailand.', NULL, NULL, NULL, NULL, NULL, NULL, 'Vn Creature'),
(3151, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Limnonectes', NULL, 'GEN_1083', 'limnonecteslimnocharis', 'Limnonectes limmocharis', '(Gravenhorst, 1829)', 'Nhái', 'SPA_03165', 'Mõm dài và nhọn, dài hơn so với mắt (SL 8,69 mm, ED 5 mm); gờ mõm tù; vùng má hơi lõm và xiên; lỗ mũi tròn, gần mút mõm hơn mắt; khoảng cách gian mũi rộng hơn khoảng cách gian ổ mắt; đường kính mắt lớn hơn chiều rộng mí mắt trên và khoảng cách gian ổ mắt (ED 5 mm, UEW 4,38 mm, IOD 4,28 mm); màng nhĩ rõ, đường kính màng nhĩ bằng khoảng 2/3 đường kính mắt (TD 3,52 mm); răng lá mía xếp thành 2 hàng hình chữ V; lưỡi dài, xẻ thùy ở phía sau; con đực có 2 túi kêu.\nNgón tay hoàn toàn tự do; chân 1/3 có màng bơi; củ bàn trong dài, củ bàn ngoài bé; khi gập dọc thân khớp chày-cổ chạm giữa mắt, khớp cổ-bàn chạm mút mõm. Gờ da trên màng nhĩ rõ, mặt trên lưng có nhiều nếp da ngắn. Màu sắc khá đa dạng ở các cá thể khác nhau. Mặt trên đầu, lưng có màu xanh rêu hay nâu nhạt; giữa hai mắt thường có vệt sẫm hình chữ V nông; giữa sống lưng đôi khi có vệt sáng từ mút mõm tới trước hậu môn, vệt sáng này có khi rộng ở phần trên đầu nhưng hẹp dần về phía sau; bụng và mặt dưới chi trắng; chi sau có các vệt sẫm màu vắt ngang.\nSinh học, sinh thái:\nThường gặp ở những nơi ẩm ướt trong các khu rừng thường xanh, đồng ruộng, ven suối, vườn cây...Mùa sinh sản thường kéo dài từ tháng 3 đến tháng 6 hoặc muộn hơn tuỳ từng vùng. Ban ngày chúng ẩn náu nơi đất trũng hay những kẽ đất, đến xẩm tối mới nhảy ra kiếm mồi. Chúng nhảy giỏi và có thể nhảy xa khoảng 2m, bơi rất giỏi. Thức ăn chủ yếu của chúng là kiến, mối, côn trùng đất', NULL, 'Việt Nam: Khắp nơi từ Bắc đến Nam ở độ cao thấp đến trung bình.\nThế giới: Afghanistan, Pakistan, Ấn Độ, Nêpal, Sri Lanka, Bangladesh, Trung Quốc, Mianma, Lào, Thái Lan, Cambodia, Phillipine, Indonesia, Nhật Bản.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/e_chitiet.php?page=4&loai=1&img=1&ID=5878'),
(3152, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Limnonectes', NULL, 'GEN_1083', 'limnonectespoilani', 'Limnonectes poilani', '(Bourret, 1942)', 'Ếch Pôi - lan', 'SPA_03166', 'Đặc điểm nhận dạng:\n\nKích thước con đực khoảng: 40 - 85mm. Một đặc điểm rất dễ nhận dạng là có một sọc trắng từ đỉnh đầu đến mút hậu môn. Đầu con đực thường rất rộng, phồng ở vùng chậm và có hai răng nanh ở phía trước hàm dưới. Con cái đầu hẹp bơn, không phồng ở chậm và không có hai răng nanh ở phía trước hàm dưới, kích thước khoảng: 45 - 84mm. Màng nhĩ ở ếch trơn không rõ. Đầu có nếp da từ mắt vòng phía sau gốc mép đến gần đầu cánh tay. Lưng màu nâu, ở nhiều cá thể có một vệt vàng kem chạy giữa sóng lưng. Da trơn, thường có một vệt đen chạy ngang hai mắt. Bàn chân có màng hoàn toàn.\n\nSinh học, sinh thái:\n\nSống trong các khe, kẽ đá ở suối nước chảy trong rừng sâu ở độ cao từ 50 đến 1.700m. Kiếm ăn ban đêm, thức ăn là các loài bọ cánh cứng, gián rừng, châu chấu, sâu non, cuốn chiếu, gọng vỏ, kiến, cua, giun... sống trong khu vực loài này phân bố. Đẻ trứng khoảng tháng 3  đến tháng 6 hàng năm, trứng có màng trong suốt, dường kính 2,5 - 3mm, số lượng 100 - 500 quả.', NULL, 'Việt Nam: ở các vùng miền núi trên cả nước. Loài này là nguồn thực phẩm của nhân dân miền núi, tiêu diệt côn trùng có hại.\n\nThế giới: Lào, Cambodia.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3153, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Nanorana', NULL, 'GEN_1288', 'nanoranaoenea', 'Nanorana oenea', '(Smith, 1922)', 'Ếch doi-chang', 'SPA_03167', 'Con đực trưởng thành của ếch Doichang có chiều dài từ mõm đến lỗ hậu môn là 65 - 77 mm và có gai ở một số bộ phận trên cơ thể, một đặc điểm giới tính thứ cấp của con đực', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.thainationalparks.com/species/doichang-frog'),
(3154, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Nanorana', NULL, 'GEN_1288', 'nanoranayunnanensis', 'Nanorana yunnanensis', '(Anderson, 1879)            ', 'Ếch gai vân nam', 'SPA_03168', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3155, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Occidozyga', NULL, 'GEN_1350', 'occidozygalaevis', 'Occidozyga laevis', '(Günther, 1858)', 'Cóc nước nhẵn ', 'SPA_03169', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3156, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Occidozyga', NULL, 'GEN_1350', 'occidozygalima', 'Occidozyga lima', '(Gravenhorst, 1829)            ', 'Cóc nước sần', 'SPA_03170', 'Cơ thể có kích thước nhỏ. Đầu bé, mõm hẹp vượt quá hàm dưới, không có gờ mõm. Không có răng lá mía, lưỡi dài hẹp, nhọn ở sau. Mắt lớn và lồi, đường kính mắt lớn hơn gian ổ mắt và chiều rộng mí mắt trên. Lỗ mũi gần ở trung gian giữa mắt và mút mõm, hơi hướng lên trên. Màng nhĩ ẩn. Ngón tay I bằng ngón II và IV, ngón III dài nhất; giữa các ngón tay có ½ đến 2/3 màng. Màng giữa các ngón chân rất rộng, hoàn toàn. Mút ngón chân hơi nhọn. Củ cạnh ngoài bàn chân tròn, cao; củ trong thành nếp nhô cao. Có nếp hạt ở cổ chân. Khớp chày - cổ đến mép miệng, khớp cổ - bàn gần chạm mũi.\n\nDa nổi hạt to nhỏ không đều, ở mõm có hạt nhỏ. Lưng và đầu màu xanh hay nâu vàng nhạt, có sọc lớn giữa lưng từ mút mõm đến huyệt. Mặt trên chi trước, chi sau màu xanh nhạt điểm các vệt nâu sẫm. Bụng màu trắng nhạt. Có vệt nâu sẫm từ nách đến bàn tay và từ gốc hai đùi đến khớp gối. Kiếm ăn ban đêm, xuất hiện ở các khu vực các kiểu rừng từ nguyên sinh đến thứ sinh ven suối hay khu vực đầm lầy, các vũng nước đọng trong rừng. Thức ăn là các loài côn trùng sống trong khu vực sinh sống. Đẻ trứng vào tháng mùa mưa hằng năm ở các con suối và nòng nọc phát triển ở đó.', NULL, 'Loài này phân bố rộng hầu khắp các tỉnh ở Việt Nam trong từng thường xanh đến 600m và cả ở khu vực đất nông nghiệp. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vn Creature'),
(3157, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Occidozyga', NULL, 'GEN_1350', 'occidozygamartensii', 'Occidozyga martensii', '(Peters, 1867)            ', 'Cóc nước macten', 'SPA_03171', 'Loài lưỡng cư này có kích thước khá nhỏ, dài thân 40mm, đầu nhỏ, mõm tròn, không có gờ canthus. Lưỡi hình oval, tròn đầu, mắt hướng lên trên và sang bên. Kích thước đầu dài hơn rộng (HL 9,37 mm, HW 7,88 mm); mắt lớn lồi; mõm hẹp vượt quá hàm dưới; không có răng lá mía; lưỡi tròn ở phía sau, màng nhĩ ẩn, co túi kêu. Ngón tay và ngón chân có đĩa nhỏ; khi gập dọc thân khớp cổ-bàn chạm mắt; ngón chân có màng hoàn toàn, ngoại trừ ngón IV; có củ bàn trong. Da lưng nhẵn ở phía trước, phần sau có một số nốt sần nhỏ, da bụng nhẵn. Màu sắc khi sống: lưng màu xám; vùng giữa hai mắt có một sọc ngang, sẫm màu; có 2 dải sáng dọc từ mút mõm đến mắt và từ sau ổ mắt đến gần bẹn; chi có các vệt ngang, bụng màu trắng. Loài này thường sống phổ biến ở vùng có vũng nước tĩnh, khu vực ngập nước trong rừng thứ sinh hay các bãi lầy. Thường gặp một số lượng cá thể khá lớn trong một khu vực. Thức ăn của loài này là các loài côn trùng nhỏ như kiến, mối. Mùa sinh sản từ tháng 3-5 hàng năm (ở khu BTTN Vĩnh Cửu Đồng Nai), khi ghép đôi chúng thường kêu rất to và vang khắp', NULL, 'Đây là loài có vùng phân bố Ninh Bình, Thanh Hoá, Gia Lai và ở Lân Đồng, Đồng Nai, Bình Phước, Bà Rịa – Vũng Tàu (Núi Dinh). ', NULL, NULL, NULL, NULL, NULL, NULL, 'Agriviet'),
(3158, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Occidozyga', NULL, 'GEN_1350', 'occidozygavittata', 'Occidozyga vittata', '(Andersson, 1942)', 'Cóc nước sọc', 'SPA_03172', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3159, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Quasipaa', NULL, 'GEN_1703', 'quasipaadelacouri', 'Quasipaa delacouri', '(Angel, 1928)', 'Ếch vạch', 'SPA_03173', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3160, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Quasipaa', NULL, 'GEN_1703', 'quasipaaspinosa', 'Quasipaa spinosa', '(David, 1875)            ', 'Ếch gai', 'SPA_03174', 'Mặt sau màu nâu sẫm, xen kẽ những đốm dày đặc màu vàng; với những nếp nhăn thưa thớt. Có dải đen giữa hai mắt. Da thô ráp với các nốt sần và hạt\nCon đực có gai sừng ngắn ở ngực và các ngón tay; với tứ chi khỏe mạnh và cơ bắp. Ngón chân hoàn toàn có màng Thường được tìm thấy nằm trên đá ở suối. Thức ăn cua nước ngọt và côn trùng khác. Sinh sản trong mùa mưa, ấu trùng màu xám đen, kích thước rất lớn khoảng 60 mm.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'biosch.hku'),
(3161, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Dicroglossidae', 'Ếch Nhái Chính Thức', 'FAM_123', 'Quasipaa', NULL, 'GEN_1703', 'quasipaaverrucospinosa', 'Quasipaa verrucospinosa', '(Bourret, 1937)            ', 'Ếch gai sần', 'SPA_03175', 'Chiều dài thân trung bình 82mm (cá thể đực lớn nhất: 105mm, cá thể cái lớn nhất: 100mm). Đầu rộng mõm tù, nếp thái dương to chạy từ sau mắt đến gần chân trước. Màng nhĩ không rõ. Lưng màu xám hay xám nâu pha những vết vàng nhạt, con non có màu nâu đỏ. Trên lưng có những mụn cóc lớn hình hầu dục chạy gần thẳng hàng, trên mỗi mụn cóc có từ 2 - 3 đôi khi hơn những vai đen nhỏ. Giữa hai mụn cóc lớn có từ 1 - 5 mụn cóc nhỏ xếp xít nhau. Mặt trên các chi có nhiều vết xám to chạy ngang. Phần ngực, bụng và trên ngón I và II chân trước của con đực có nhiều gai nhỏ đen. Sống ở các suối chảy sâu trong rừng, tập trung ở đầu nguồn các con suối lớn, nơi có nhiều đá to, ít nước. Kiếm ăn ban đêm, thích ngâm mình trong nước rình mồi. Thức ăn gồm côn trùng cánh cứng, sâu non, ấu trùng chuồn chuồn, gián rừng, gọng cua. Tiếng kêu ban đêm rất lớn và âm vang. Ở một số nơi, đồng bào dân tộc gọi là ếch bò vì có tiếng kêu giống bò. Đẻ trứng từ tháng 8 đến tháng 11, ở suối nơi nước chảy chậm mỗi lần khoảng 200 - 300 trứng đường kinh 3,5 - 3,7mm. Nòng nọc phát triển trong nước.', NULL, 'Việt Nam: Lào Cai: Hà Giang. Tuyên Quang, Cao Bằng: Bắc Kạn, Vĩnh Phúc, Phú Thọ, Hòa Bình, Nghệ An, Thừa thiên Huế, Quảng Nam, Gia Lai, Kontum, Lâm Đồng. Nam Trung Quốc, Lào.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(3162, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Hylidae', 'Nhái Bén', 'FAM_192', 'Hyla', NULL, 'GEN_0922', 'hylaannectans', 'Hyla anectans', 'Jerdon, 1870', 'Nhái bén dính', 'SPA_03176', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3163, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Hylidae', 'Nhái Bén', 'FAM_192', 'Hyla', NULL, 'GEN_0922', 'hylasimplex', 'Hyla simplex', 'Boettger, 1901            ', 'Nhái bén nhỏ', 'SPA_03178', 'Cơ thể nhỏ bé như các loài nhái nhưng bụng khá to và chân mảnh. Con đực nhỏ hơn con cái. Thân dài 28mm, con cái thân dài khoảng 35 - 40cm. Thân mặt lưng màu lục, mặt bên và bụng màu trắng. Từ góc mắt sau tới mặt trên vai có đường vân nhỏ màu lục đậm, bên thân có điểm vân đen hoặc nối liền nhau thành đường đen, hoặc liên tục xếp thành hàng. Mặt lưng da bóng, ngực bụng và mặt dưới đầu có nốt dẹt bằng phân bố dày, bụng thường bóng. Ngón ở chân trước và sau đều có giác bám và khe ngang. Bàn chân, tay thường có các nốt nhỏ. \n\nSinh học, sinh thái:\n\nNhái bén thường sống khắp các khu vực có rừng ở độ cao từ 400m đến 900m. Ban ngày hay mùa đông chúng thường ẩn náu trong các bụi cây nhỏ, khe đá, cây bụi, kiếm ăn ban đêm. Thức ăn chính của chúng là các loài côn trùng, bọ cánh cứng, dế con, mối... Mùa sinh sản thường kéo dài từ tháng 3 đến tháng 6 hoặc muộn hơn tuỳ từng vùng.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=4&loai=1&ID=5701'),
(3164, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Brachytarsophrys', NULL, 'GEN_0246', 'brachytarsophrysfeae', 'Brachytarsophrys feae', '(Boulenger, 1887)', 'Cóc mày phê', 'SPA_03179', ' là loài ếch lớn: con đực dài khoảng 96 mm (3,8 in) và con cái dài khoảng 101 mm (4,0 in) tính từ mõm đến lỗ huyệt. Nòng nọc có kích thước nhỏ so với chiều dài khoảng 39 mm', NULL, 'Nó được tìm thấy ở miền nam Trung Quốc (Quảng Tây và Vân Nam) và miền bắc Myanma , Thái Lan và Việt Nam ; nó có thể xảy ra ở Lào', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Brachytarsophrys_feae'),
(3165, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Brachytarsophrys', NULL, 'GEN_0246', 'brachytarsophrysintermedia', 'Brachytarsophrys intermedia', '(Smith, 1921)', 'Cóc mắt trung gian', 'SPA_03180', 'Đặc điểm nhận dạng:\n\nĐầu hơi dẹp, rộng hơn dài và rộng hơn chiều rộng thân. Mõm gần tròn, phần mút mõm nơi tiếp xúc giữa gờ mõm và gờ môi trên tạo thành gờ nhọn. Gờ mõm, gờ má rõ, sắc, nối liền với mấu da trên mí mắt và kéo dài nối với nếp da sau mắt xuống phía trước gốc vai. Vùng má hơi lõm. Miệng rộng; răng lá mía mảnh, xếp gần thẳng, cách xa nhau, không chạm và vượt quá lỗ mũi trong. Lưỡi rộng, gần tròn, gốc lưỡi hẹp. Lỗ mũi ở phía bên, nằm gần mút mõm hơn mắt.\n\nMàng nhĩ không rõ ràng. Mắt trung bình, gian ổ mắt rộng, đường kính ổ mắt bằng 0,79 lần gian ổ mắt và bằng 1,33 lần chiều rộng mí mắt trên. Chi mảnh, ngắn. Ngón tay I ngắn hơn ngón II và IV, ngón III dài nhất. Ngón chân có 1/3 màng da, củ bàn trong không rõ, không có củ bàn ngoài. Khớp chày - cổ đến góc hàm, khớp cổ - bàn chưa đến mắt. Trên lưng có nếp da mảnh ở hai bên phía sau đầu (ngang với mép miệng) kéo dài đến giữa thân; một nếp da khác ở mỗi bên sườn từ trên gốc vai đến giữa thân ngang với nếp trên lưng. Hai bên thân nổi các hạt màu trắng.\n\nTrong dung dịch bảo quản: đầu và thân màu nâu nhạt, giữa lưng phần giới hạn giữa hai nếp da màu nâu sẫm; một vệt ngang mảnh sẫm màu giữa hai mắt; một vệt đen nhỏ ở phần cuối nếp da sau mắt. Mặt trên đùi, ống và cổ chân có 2 vệt sẫm, giữa các vệt có nếp da mảnh. Vùng họng, cằm và ngực màu nâu đen, phần bụng và dưới các chi đen nhạt hơn. Mút các ngón tay và chân đen nhạt.\n\nSinh học, sinh thái:\n\nKiếm ăn ban đêm, xuất hiện ở các khu vực rừng thường xanh núi cao từ 600 – 1000m. Thức ăn là các loài côn trùng, ếch nhái nhỏ sống trong khu vực sinh sống. Đẻ trứng vào tháng mùa mưa hằng năm ở các con suối và nòng nọc phát triển ở đó.', NULL, 'Việt Nam: Quảng Bình, Thừa Thiên-Huế, Kontum, Gia Lai, Đắk Lắk, Lâm Đồng, Khánh Hòa, Đồng Nai.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3166, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptobrachella', NULL, 'GEN_1052', 'leptobrachellaeos', 'Leptobrachella eos', '(Ohler, Wollenberg, Grosjean, Hendrix, Vences, Ziegler&Dubois, 2011)', 'Cóc mày e-os', 'SPA_03181', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3167, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptobrachella', NULL, 'GEN_1052', 'leptobrachellalateralis', 'Leptobrachella lateralis', '(Anderson, 1871)', 'Cóc mày na-ga-lan', 'SPA_03182', 'Con đực trưởng thành có kích thước 27–28 mm (1,1–1,1 in) và con cái trưởng thành có chiều dài mõm-lỗ thông khoảng 37 mm (1,5 in) . Phần lưng có một số đốm đen hình tam giác hoặc không đều. Phần bụng có màu vàng nhạt có vân cẩm thạch màu nâu. Hai bên sườn có vài đốm đen nhỏ. Có một đường gờ tuyến bên bụng màu trắng, được gọi bằng tên cụ thể là Lateralis . Các ngón chân chỉ có màng thô sơ.', NULL, 'Nó chỉ được biết đến với sự tin cậy từ khu vực thuộc địa phương điển hình của nó và từ Nagaland ở Đông Bắc Ấn Độ . Phạm vi của nó có thể mở rộng tới Vân Nam , Trung Quốc', NULL, NULL, NULL, NULL, NULL, NULL, 'https://inaturalist.nz/photos/147508'),
(3168, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptobrachella', NULL, 'GEN_1052', 'leptobrachellaminima', 'Leptobrachella minima', '(Taylor, 1962)', 'Cóc mày nhỏ', 'SPA_03183', 'Màu sắc khi sống: Mặt lưng đầu và thân màu xám nâu có vết hình tam giác giữa hai mắt, giữa lưng có vài đốm xám; mặt lưng của chi trước và chi sau màu nâu xám có sọc sẫm; họng và ngực màu xám trong suốt, viền họng màu xám có đốm trắng; bụng trắng', NULL, 'Tại Việt Nam, L. minima được biết đến ở các tỉnh Sơn La, Điện Biên, Hòa Bình, Quảng Ninh và Thanh Hóa ( Frost 2021). Ở những nơi khác, loài này đã được ghi nhận ở Thái Lan và Lào ( Frost 2021).', NULL, NULL, NULL, NULL, NULL, NULL, 'https://tb.plazi.org/GgServer/html/EC4C049518D9525CA91D05EBFEAC89BE'),
(3169, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptobrachella', NULL, 'GEN_1052', 'leptobrachellapelodytoides', 'Leptobrachella pelodytoides', '(Boulenger, 1893)', 'Cóc mày bùn', 'SPA_03184', 'Đông Myanmar ở vùng Karin Hills thuộc địa phương điển hình và miền nam Vân Nam (Mộng Dương), Trung Quốc, từ một địa điểm gần biên giới Lào và Myanmar; Thái Lan (các tỉnh Mae Hong Son, Chiang Mai, Lampang, Loei, Chaiyaphum, Uthai Thani, Kanchana Buri và Surat Thani); hồ sơ từ Việt Nam, Ấn Độ và Lào hiện nay được xếp vào các loài đã được đặt tên và chưa được đặt tên', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://amphibiansoftheworld.amnh.org/Amphibia/Anura/Megophryidae/Leptobrachiinae/Leptobrachella/Leptobrachella-pelodytoides'),
(3170, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptobrachella', NULL, 'GEN_1052', 'leptobrachellasungi', 'Leptobrachella sungi', '(Lathrop, Murphy, Orlov&Ho, 1998)', 'Cóc mày sung', 'SPA_03185', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3171, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptobrachella', NULL, 'GEN_1052', 'leptobrachellatadungensis', 'Leptobrachella tadungensis', '(Rowley, Tran, Le, Dau, Peloso, Nguyen, Hoang, Nguyen & Ziegler, 2016)', 'Cóc Tà Đùng', 'SPA_03186', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3172, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptobrachella', NULL, 'GEN_1052', 'leptobrachellaventripunctata', 'Leptobrachella ventripunctata', '(Fei, Ye &Li, 1990)', 'Cóc mày bụng đốm', 'SPA_03187', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3173, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptobrachium', NULL, 'GEN_1053', 'leptobrachiumbanae', 'Leptobrachium banae', 'Lathrop, Murphy, Orlov, and Ho, 1998', 'Cóc mày ba na', 'SPA_03188', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3174, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptobrachium', NULL, 'GEN_1053', 'leptobrachiumchapaense', 'Leptobrachium chapaense', '(Bourret, 1937)', 'Cóc mày Sa Pa', 'SPA_03189', 'Loài này có ở Trung Quốc, Lào, Thái Lan, Việt Nam, và có thể cả Myanma. Môi trường sống tự nhiên của chúng là rừng ẩm vùng đất thấp nhiệt đới hoặc cận nhiệt đới, vùng núi ẩm nhiệt đới hoặc cận nhiệt đới, và ven sông ngòi. Chúng hiện đang bị đe dọa vì mất môi trường sống.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.'),
(3175, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptobrachium', NULL, 'GEN_1053', 'leptobrachiumechinatum', 'Leptobrachium echinatum', 'Dubois & Ohler, 1998', 'Cóc bùn', 'SPA_03190', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3176, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptobrachium', NULL, 'GEN_1053', 'leptobrachiumhasselti', 'Leptobrachium hasselti', 'Tschudi, 1838', 'Cóc mày Hatxen', 'SPA_03191', 'Thể trạng tương đối rắn chắc. Thân thon đến háng. Đầu rộng và trũng xuống. Chiều dài đầu và rộng đầu bằng nhau. Mõm tròn hoặc rất rù ở điểm nhìn lưng, đổ gập ở góc nhìn nghiêng, nhô ra quá hàm dưới ở góc nhìn nghiêng. Mũi ở ngay đường giữa mót mõm và mắt, dưới góc mắt. Khoảng cách hai lỗ mũi ngắn hơn khoảng cách gian ổ mắt. Góc mắt rõ. Vùng trước mắt xéo, tương đối lõm. Mắt lớn, hơi lồi từ mặt của đầu, đường kính bằng chiều dài mõm, khoảng cách hai ổ mắt bằng chiều rộng mí mắt trên. Không có mắt đơn tuyến tùng. Răng lá mía tiêu biến. Chân sau mảnh. Ngón chân tương đối mảnh, không có màng. Đầu ngón chân tù, các ngón 1 và II hơi phồng ụ,  khác biệt số đo chiều dài giữa các ngón: II = IV<I<II<V<III. Màng nhĩ tròn, hình vành khuyên tương đối có thể nhận ra, đường kính màng nhĩ bằng khoảng 50% đường kính mắt và lớn hơn khoảng cách giữa màng nhĩ và mắt. Lưỡi hình trái tim, lõm về phía sau.\n\n Chiều dài từ mút mõm đến lỗ huyệt 48.0 mm; Chiều dài đầu từ mút mõm đến sau cằm 20.7mm; Rộng đầu lớn nhất 20.9mm; Chiều dài từ mút mõm đến trước góc mắt 8.5 mm; Đường kính mắt 7.1 mm; Khoảng cách gian ổ mắt 6.3 mm; Khoảng cách hai mũi 4.2 mm; Chiều dài cẳng chân 16.9 mm; Chiều dài bắp đùi 18.7 mm; Chiều dài cánh chân trước ( từ cùi chỏ đến nốt ụ gan bàn chân ngoài) 14.2 mm; Chiều dài bàn chân trước (từ chóp ngón thứ ba đến nốt gan bàn chân ngoài) 11.7 mm; Chiều dài chân từ chóp ngón thứ tư đến đáy nốt u đốt bàn chân 17.9 mm; Chiều dài nốt u đốt bàn chân trong 2.7 mm; Chiều rộng nốt u đốt bàn chân trong 1.4 mm\n\n Túi kêu lớn, có dạng như khe hở, ở đáy miệng gần mép bên của lưỡi. Vòng màng nhĩ đủ có thể nhận biết. Lưng có màu nâu kèm đốm sẫm và có vài nốt sần, không có những vết sẫm lớn. Sọc đen dưới góc mắt và nếp màng nhĩ trên, phủ qua màng nhĩ. Có vệt trắng trên lưng và mặt trước của đùi, mặt sau của cẳng chân và mặt lưng của cổ chân. Những vệt trắng mờ ở trên mặt lưng của chân trước, mặt trước của cẳng chân và mặt quanh trục cổ chân. Có những đốm trắng lớn ở sườn, nhiều hơn ở bên phải. Bụng có màu be với những đốm trắng trên ụ sần. sáng hơn ở lưng, không có nết sẫm. Mặt bụng của đùi sẫm màu hơn bụng, có đốm trắng trên nốt sần. Chân có màu đen với những vết trắng bạc. Trong dạng tiêu bản, màu sắc gần giống mẫu sống\n\nPhân bố: Bidup Núi Bà.\n\nSinh học, sinh thái:\n\nChỉ bắt gặp vào mùa mưa ở các khu vực rừng mưa nhiệt đới thường xanh núi cao thuộc Vườn quốc gia Bi doup - Núi Bà, Lâm Đồng. Bắt gặp đẻ trứng ở các vũng nước đọng trong rừng và các con suối chảy chậm, chưa có nhiều dẫn liệu về ấu trùng, nhưng chúng cũng có vòng đời biến thái hoàn toàn như các loài lưỡng cư khác.', NULL, 'Khu bảo tồn thiên nhiên Hòn Bà, Khánh Hoà', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(3177, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptobrachium', NULL, 'GEN_1053', 'leptobrachiumleucops', 'Leptobrachium leucops', 'Stuart, Rowley, Tran, Le & Hoang, 2011', 'Cóc mày mắt trắng ', 'SPA_03192', 'Đặc điểm nhận dạng:\nCơ thể khá mập mạp, hơi thon về phía hông. Đầu rộng và dẹp (chiều dài và chiều rộng gần bàng nhau); mõm tròn (theo hướng lưng bụng) và dốc nghiêng (theo hướng mặt bên), có chiều dài gần bằng với đường kính mắt; mũi gần mõm hơn gần mắt; mắt to, hơi nhô, khoảng cách giữa 2 mắt gần bằng với chiều rộng của mí mắt; màng nhĩ không thấy rõ, tròn, có đường kính khoảng 40% đường kính mắt, khoảng cách giữa mắt và màng nhĩ nhỏ hơn đường kính màng nhĩ; không có răng lá mía, lưỡi to, hình trái tim , có rãnh ở phía sau.\nChân trước mảnh khảnh, các ngón không có màng bơi; chiều dài tương đối của các ngón tay: II=IV<I<III; đầu các ngón cùn, hơi phình to ở đầu ngón tay I &; không có chai tay. Chân sau mảnh khảnh và hơi ngắn; đầu các ngón chân cùn, hơi phình to; chiều dài tương đối của các ngón chân: I<II<III = V<IV; mấu lồi trong rõ, hình oval, có chiều dài khoảng 70% chiều dài ngón chân I; không có mấu lồi ngoài. Da lưng trơn láng với mạng lưới nếp da mảnh, phía sau lưng có các hạt nhỏ, đặc biệt là vùng gần hậu môn; nếp trên màng nhĩ kéo dài từ sau mắt tới vai; bụng có hạt, mặt bụng của các ngón trơn láng; tuyến nách tròn, nằm ở phía hông bụng, hơi phía sau vị trí nách; tuyến đùi rõ, tròn nằm ở mặt sau đùi, khoảng giữa đầu gối và hậu môn.\nLưng có màu xám sậm, với các vệt hình chũ Y mầu nâu sậm, kéo dài từ phía trên mí mắt tới phần sau của lưng, có viền màu kem, với các vệt nhỏ hơn, có hình dạng không nhất định, màu thay đổi từ nâu sậm tới đen, viền màu kem; phần trên hông màu nâu sậm với các vệt đen viền kem hoặc trắng, phần dưới hông màu xám sậm với nhũng đốm tròn trắng, nhỏ; mặt trên của chân trước có màu nâu với các vạch xám sậm và màu kem; mặt trên của chân sau màu trắng hoặc trắng kem với các vạch xám sậm và đen; mắt màu đen với 1/3 phía trên của con ngươi có màu trắng, vòng cung màu xanh dương (thấy khi vạch màng mắt, nằm ở góc sau của mắt). Trên mép môi trên cho tới mõm và từ mép môi trên tới bờ sau của mắt có vạch màu nâu; 1 vệt màu đen nằm bên dưới mắt và nếp da trên màng nhĩ, bao phủ cả màng nhĩ; mặt dưới của cơ thể và chân có màu từ xám - đỏ tía tới xám sậm, vùng cằm, ngực, bụng và vùng kéo dài từ phía trên tới bờ ngoài mặt dưới của các chân có các đốm nhỏ màu đen và các đốm tròn trắng trên các mấu; tuyến nách và tuyến đùi có màu trắng kem.\nSinh học, sinh thái:\nSống ở khu rừng rừng thường xanh núi cao, ở độ cao khoảng 1.558  -  1.900m nơi có lớp thảm mục thực vật dày và ẩm. Chỉ xuất hiện vào ban đêm, mùa mưa. Thức ăn là các loài côn trùng sống trong khu vực. Đôi khi thấy chúng ban ngày nằm trong các gop61c cây mục, thân gỗ mục trong rừng. Leptobrachium leucops phân biệt với các loài Leptobrachium khác bởi kích thước nhỏ (con đực có chiều dài khoảng 38,8 - 45,2mm), khoảng 1/3 phía trên của con ngươi có màu trắng; mặt bụng có màu sậm. Tiếng kêu của loài này, bao gồm 1 - 5 nốt, kéo dài khoảng 122 - 1.699ms, với tần số khoảng 1.033,6 - 155Hz', NULL, 'Đỉnh núi Bà thuộc Vườn quốc gia Bidoup - Núi Bà và trên cao nguyên Langbian, thuộc ranh giới giữa 2 tỉnh Lâm Đồng và Khánh Hòa.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3178, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptobrachium', NULL, 'GEN_1053', 'leptobrachiummouhoti', 'Leptobrachium mouhoti', 'Stuart, Sok & Neang, 2006', 'Cóc mày', 'SPA_03193', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3179, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptobrachium', NULL, 'GEN_1053', 'leptobrachiumpullum', 'Leptobrachium pullum', 'Smith, 1921', 'Cóc mày mắt đỏ ', 'SPA_03194', 'Đặc điểm nhận dạng:\nThể trạng tương đối rắn chắc. Thân thon đến háng. Đầu rộng và trũng xuống. Chiều dài đầu và rộng đầu bằng nhau. Mõm tròn hoặc rất rù ở điểm nhìn lưng, đổ gập ở góc nhìn nghiêng, nhô ra quá hàm dưới ở góc nhìn nghiêng. Mũi ở ngay đường giữa mót mõm và mắt, dưới góc mắt. Khoảng cách hai lỗ mũi ngắn hơn khoảng cách gian ổ mắt. Góc mắt rõ. Vùng trước mắt xéo, tương đối lõm. Mắt lớn, hơi lồi từ mặt của đầu, đường kính bằng chiều dài mõm, khoảng cách hai ổ mắt bằng chiều rộng mí mắt trên. Không có mắt đơn tuyến tùng. Răng lá mía tiêu biến. Chân sau mảnh. Ngón chân tương đối mảnh, không có màng. Đầu ngón chân tù, các ngón 1 và II hơi phồng ụ,  khác biệt số đo chiều dài giữa các ngón: II = IV<I<II<V<III. Màng nhĩ tròn, hình vành khuyên tương đối có thể nhận ra, đường kính màng nhĩ bằng khoảng 50% đường kính mắt và lớn hơn khoảng cách giữa màng nhĩ và mắt. Lưỡi hình trái tim, lõm về phía sau.\n Chiều dài từ mút mõm đến lỗ huyệt 48.0 mm; Chiều dài đầu từ mút mõm đến sau cằm 20.7mm; Rộng đầu lớn nhất 20.9mm; Chiều dài từ mút mõm đến trước góc mắt 8.5 mm; Đường kính mắt 7.1 mm; Khoảng cách gian ổ mắt 6.3 mm; Khoảng cách hai mũi 4.2 mm; Chiều dài cẳng chân 16.9 mm; Chiều dài bắp đùi 18.7 mm; Chiều dài cánh chân trước ( từ cùi chỏ đến nốt ụ gan bàn chân ngoài) 14.2 mm; Chiều dài bàn chân trước (từ chóp ngón thứ ba đến nốt gan bàn chân ngoài) 11.7 mm; Chiều dài chân từ chóp ngón thứ tư đến đáy nốt u đốt bàn chân 17.9 mm; Chiều dài nốt u đốt bàn chân trong 2.7 mm; Chiều rộng nốt u đốt bàn chân trong 1.4 mm\n Túi kêu lớn, có dạng như khe hở, ở đáy miệng gần mép bên của lưỡi. Vòng màng nhĩ đủ có thể nhận biết. Lưng có màu nâu kèm đốm sẫm và có vài nốt sần, không có những vết sẫm lớn. Sọc đen dưới góc mắt và nếp màng nhĩ trên, phủ qua màng nhĩ. Có vệt trắng trên lưng và mặt trước của đùi, mặt sau của cẳng chân và mặt lưng của cổ chân. Những vệt trắng mờ ở trên mặt lưng của chân trước, mặt trước của cẳng chân và mặt quanh trục cổ chân. Có những đốm trắng lớn ở sườn, nhiều hơn ở bên phải. Bụng có màu be với những đốm trắng trên ụ sần. sáng hơn ở lưng, không có nết sẫm. Mặt bụng của đùi sẫm màu hơn bụng, có đốm trắng trên nốt sần. Chân có màu đen với những vết trắng bạc. Trong dạng tiêu bản, màu sắc gần giống mẫu sống.\nSinh học, sinh thái:\n\nChỉ bắt gặp vào mùa mưa ở các khu vực rừng mưa nhiệt đới thường xanh núi cao thuộc Vườn quốc gia Bi doup - Núi Bà, Lâm Đồng. Bắt gặp đẻ trứng ở các vũng nước đọng trong rừng và các con suối chảy chậm, chưa có nhiều dẫn liệu về ấu trùng, nhưng chúng cũng có vòng đời biến thái hoàn toàn như các loài lưỡng cư khác.', NULL, 'Khu bảo tồn thiên nhiên Hòn Bà, Khánh Hoà', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3180, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptobrachium', NULL, 'GEN_1053', 'leptobrachiumxanthospilum', 'Leptobrachium xanthospilum', 'Lathrop, Murphy, Orlov & Ho, 1998', 'Cóc mày đốm vàng', 'SPA_03195', 'Loài này có tên cụ thể từ tiếng Hy Lạp \"xanthos\", có nghĩa là màu vàng và \"spilos\", có nghĩa là đốm và dùng để chỉ những đốm màu vàng nổi bật của loài.', NULL, 'ược mô tả dựa trên một mẫu vật duy nhất được thu thập từ Vườn quốc gia Pù Mát, tỉnh Nghệ An, miền bắc Việt Nam', NULL, 'Đặc hữu của Việt Nam', NULL, NULL, NULL, NULL, 'https://www.researchgate.net/figure/Leptobrachium-xanthospilum-from-Kon-Plong-District-Kon-Tum-Province-1250-m-asl_fig9_282295129'),
(3181, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptolalax', NULL, 'GEN_1060', 'leptolalaxapplepyi', 'Leptolalax applepyi', 'Rowley và Cao, 2009', 'Cóc mày applepy', 'SPA_03196', 'Dài thân của cá thể đực 19,6 - 20,8mm, cá thể đực 21,7mm; màu nâu đậm, da mịn, không có chất hút; Bụng màu nâu hồng với những màu trắng; ngón tay không có giấc ngủ và riềm da; ngón tay chân có ngủ ở sát phần gốc bàn chân, không có riềm da; đùi ngắn.', NULL, 'Máy mày mới phát hiện năm 2009 ở khu vực rừng thường xanh trên núi cao thuộc Khu Bảo tồn thiên nhiên Sông Thanh, huyện Phước Sơn, tỉnh Quảng Nam. thuộc dãy Ngọc Linh (tỉnh Kon Tum) và Tây nam Lào.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/e_chitiet.php?page=1&loai=1&ID=5196'),
(3182, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptolalax', NULL, 'GEN_1060', 'leptolalaxbidoupensis', 'Leptolalax bidoupensis', 'Jody et al.,2011', 'Cóc mày bi đúp ', 'SPA_03197', 'Đặc điểm nhận dạng:\nLoài lưỡng cư mới phát hiện có những đặc điểm khác biệt với các loài khác trong cùng giống nhờ vào các đặc điểm như sau mặt bụng có màu đỏ nâu đậm với các đốm trắng nằm kháp trên phần cổ họng, mặt dưới của tay và chân và có kích thước nhỏ, từ 23.6 - 24.6 mm ở con đực trưởng thành (đo ở 4 cá thể) và 29.2 - 29.4 mm ở con cái trưởng thành (đo ở 2 cá thể); mống mắt có hai màu, nửa trên màu đồng đỏ và nửa dưới ngả sang màu xám đỏ; da gần như trơn láng không có các nếp gấp da; xương chày tương đối ngắn.\nLeptolalax bidoupensis  có tiếng kêu rất khác biệt với những tiếng kêu đã từng được ghi nhận ở các loài Leptolalax, gồm 6-9 nốt đơn với tần số khoảng 1.9-3.8Khz. So với hai loài tương tự về hình thái L. applebyi  và L. melicus , L. bidoupensis  co mức độ sai khác về trình tự gen khoảng 9.3% và 9.6%. Hiện tại loài mới này được ghi nhận ở những khu rừng thường xanh, ở độ cao 1620 - 1730 m so với mực nước biển, trong diện tích 1 cây số vuông. Đề nghị bổ sung loài này vào mục Dữ liệu thiếu của sách đỏ IUCN.\nLoài này có đầu hơi dài hơn rộng; mõm tròn nhìn từ phía mặt lưng, tròn và hơi nhô khi nhìn ở mặt hông; Mũi nằm gần mõm hơn mắt; mắt nhỏ hơn chiều dài mõm, con ngươi năm ngang; Màng nhĩ rõ, tròn, nhỏ hơn đường kính mắt, viền của màng nhĩ hơi nhô lên so với vùng xung quanh. Không có răng lá mía; túi kêu mở ra ỏ phía sau hai bên của vòm miệng; lưỡi dài, chiều rộng vừa phải, phía sau có 1 rãnh hình chữ V. Tuyến trên màng nhĩ, chạy từ mắt hướng tới tuyến nách; đầu các ngón tay tròn, không phình to; chiều dài tương đối của các ngón tay như sau: I<II=IV<III; không có chai tay; các mấu lồi ở các khớp ngón không hiện diện; mấu lồi trong ở bàn tay tròn, tách biệt với mấu lồi ngoài, dẹp. Các ngón tay không có màng bơi hay riềm da bên. Các đầu ngón chân tương tự các đầu ngón tay, chiều dài tương đối của các ngón chân : ngón I < II < V < III < IV. Mấu lồi dưới khớp không hiện diện và được thay thế bằng các nếp da, dễ nhận thấy ở ngón chân thứ II, III, IV và V. Ngón chân có màng bơi ở gốc, với các riềm da mảnh ở 2 bên.\nLoài này có xương chày hơi ngắn, chắc, chiều rộng bằng 1/3 chiều dài, xương chày có độ dài bằng 46% chiều dài thân, khớp xương cổ chân chạm mắt. Da lưng gần như trơn láng, có các nốt nhỏ rải rác, tập trung ở mi mắt, mặt bên bụng và mặt trên khớp cổ chân; da bụng trơn láng. Tuyến ngực hình trứng, có đường kính 1,2mm; tuyến đùi hình trứng, có đường kính 0,8mm nằm ở mặt dưới đùi, gần với đầu gối hơn lỗ huyệt. Tuyến trên nách nhô cao, đường kính khoảng 1.2 mm; một số tuyến hiện diện ỏ phân hông của bụng và lưng, tạo thành 1 đường không liên tục, đường này khó phân biệt với viền trắng ở hàm.\nSinh học, sinh thái:\nLoài mới phát hiện năm 2011 và sống chủ yếu ở những khu rừng thường xanh, ở độ cao 1.620 - 1.730 m so với mực nước biển, trong diện tích 1 cây số vuông. Leptolalax bidoupensis có tiếng kêu rất khác biệt với những tiếng kêu đã từng được ghi nhận ở các loài Leptolalax, gồm 6 - 9 nốt đơn với tần số khoảng 1.9 - 3.8Khz. So với hai loài tương tự về hình thái L. applebyi và L. melicus , L. bidoupensis có mức độ sai khác về trình tự gen khoảng 9.3% và 9.6%. Loài này sống ở các khu vực ven suối và giao phối, đẻ trứng trong các vũng nước đọng', NULL, 'mới phát hiện và công bố ở Vườn quốc gia Bidoup  -  Núi Bà năm 2011 ở cao nguyên miền Trung Việt Nam trên tạp chí Zootaxa 2796: 15 - 28 (2011).. Đây cũng là ghi nhận mới về phân bố của giống Leptolalax ở phía Nam. Đề nghị bổ sung loài này vào mục Dữ liệu thiếu của sách đỏ IUCN.', NULL, 'Loài đặc hữu Việt Nam', NULL, NULL, NULL, NULL, NULL),
(3183, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptolalax', NULL, 'GEN_1060', 'leptolalaxbourreti', 'Leptolalax bourreti', 'Dubois, 1983', 'Cóc bùn Bure', 'SPA_03198', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3184, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptolalax', NULL, 'GEN_1060', 'leptolalaxcroceus', 'Leptolalax croceus', 'Rowley, Hoang, Le, Dau & Cao, 2010', 'Cóc mày bụng cam', 'SPA_03199', 'Bụng của nó có màu cam nhạt , đây là màu duy nhất ở loài Leptolax . Nó là một loài có kích thước trung bình trong chi của nó: chiều dài lỗ mũi của 16 con đực nằm trong khoảng 22–27 mm (0,87–1,06 in)', NULL, 'Rừng thường xanh cao trên 1.300 mét tại khu bảo tồn thiên nhiên Ngọc Linh, núi Ngọc Linh huyện Đăk Glei tỉnh Kon Tum.[2]', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/C%C3%B3c_m%C3%A0y_b%E1%BB%A5ng_cam'),
(3185, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptolalax', NULL, 'GEN_1060', 'leptolalaxpelodytoides', 'Leptolalax pelodytoides', '(Boulenger, 1893)', 'Cóc mày bùn', 'SPA_03200', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3186, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptolalax', NULL, 'GEN_1060', 'leptolalaxpluvialis', 'Leptolalax pluvialis', 'Ohler, Marquis, Swan & Grosjean, 2000', 'Cóc mày nhỏ', 'SPA_03201', 'Chúng là một loài có kích thước nhỏ: con đực có chiều dài mõm dài 22–23 mm (,87–,91 in). Lưng của nó có màu nâu xám với hoa văn sẫm với một vài đốm đen ở hai bên. Nó có tròng mắt đen vàng sẫm', NULL, 'Chúng được tìm thấy ở Việt Nam cụ thể là ở núi Fansipan và cũng được cho là ở cả Vân Nam,Trung Quốc', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/C%C3%B3c_m%C3%A0y_nh%E1%BB%8F'),
(3187, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptolalax', NULL, 'GEN_1060', 'leptolalaxsapa', 'Leptolalax sapa', NULL, 'Cóc bùn Sapa', 'SPA_03202', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3188, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptolalax', NULL, 'GEN_1060', 'leptolalaxsp1', 'Leptolalax sp1.', NULL, 'Cóc mày', 'SPA_03203', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3189, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptolalax', NULL, 'GEN_1060', 'leptolalaxsungi', 'Leptolalax sungi', 'Lathrop, Murphy, Orlov & Ho, 1998', 'Cóc mày sung', 'SPA_03204', ' Loài mới có chiều dài cơ thể từ 28,mm đến 29,3mm đối với con đực và 3,3mm đối với con cái, lưng da trơn, giữa các ngón chân có màng bơi thô sơ, đầu ngón tay hình tròn, có chai chân trong không kéo dài tới ngón cái, cơ thể có các tuyến tiết, thiếu răng lá mía. Về màu sắc, lưng của loài này có màu nâu đen - xám, bề mặt bụng có màu xám nhạt đến tím với các đốm trắng. Đặc biệt, Cóc mày mắt to có mắt nhô ra ngoài và lớn hơn so với các loài cùng nhóm', NULL, 'Nó là loài đặc hữu của Việt Nam', NULL, 'Nó là loài đặc hữu của Việt Nam', NULL, NULL, 'LC', NULL, 'https://vnmn.ac.vn/mot-loai-coc-moi-cho-khoa-hoc-duoc-phat-hien-o-mien-nam-viet-nam-1548921471'),
(3190, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Leptolalax', NULL, 'GEN_1060', 'leptolalaxtuberosus', 'Leptolalax tuberosus', 'Inger, Orlov & Darevsky, 1999', 'Cóc mày sần', 'SPA_03205', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3191, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Megophrys', NULL, 'GEN_1187', 'megophrysdaweimontis', 'Megophrys daweimontis', 'Rao &Yang, 1997', 'Cóc núi da-wei', 'SPA_03206', ' Da mặt lưng nhẵn, có mụn cóc nhỏ ở hai bên sườn; nếp gấp trên màng nhĩ nổi bật; hai nếp gấp rõ rệt trên vùng xương bả vai kéo dài về phía sau đến thắt lưng; mặt sau có nếp gấp nhỏ hình chữ X; mí mắt trên có nốt sần rất nhỏ ở mép ngoài; lỗ thông hơi mịn. Màu sắc trong cuộc sống: Mắt nâu; tròng mắt xiên, màu đen; đốm xám tiếp xúc với môi trên ở gốc vết loét; mặt lưng của đầu và thân màu nâu ô liu với một vết hình tam giác giữa hai mắt, tiếp theo là một vết hình chữ X ở mặt sau; vạch đen bên dưới lỗ thông hơi và phía sau gót chân; mép ngoài bụng có những đốm đen lớn; họng, túi gular, vùng ngực và giữa bụng màu nâu sẫm có vết sẫm màu; mặt lưng các chi màu nâu nhạt có các sọc ngang hẹp, màu nâu sẫm; mặt dưới của chân có màu đỏ bên trong. Ghi chú sinh thái: Mẫu vật được tìm thấy ở bờ suối đá, trong khoảng thời gian từ 20:00 đến 22:00. Môi trường sống xung quanh là rừng thứ sinh hỗn hợp gồm gỗ cứng nhỏ và cây bụi', NULL, ' Loài này trước đây chỉ được biết đến ở núi Dawei, tỉnh Vân Nam, miền nam Trung Quốc (Rao và Yang, 1997). Địa phương mới được ghi nhận ở miền Bắc Việt Nam cách địa điểm điển hình ở Trung Quốc khoảng 180 km', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.researchgate.net/figure/Megophrys-daweimontis-from-Dien-Bien-Province-Vietnam-HNUE-MNA361-adult-male-A_fig2_283992517'),
(3192, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Megophrys', NULL, 'GEN_1187', 'megophrysiateralis', 'Megophrys iateralis', 'Dubois, 1980', 'Cóc mắt bên', 'SPA_03207', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3193, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Megophrys', NULL, 'GEN_1187', 'megophrysjingdongensis', 'Megophrys jingdongensis', '(Fei and Ye, 1983)', NULL, 'SPA_03208', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3194, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Megophrys', NULL, 'GEN_1187', 'megophryslateralis', 'Megophrys lateralis', '(Anderson, 1871)', 'Cóc mắt lớn, Cóc mắt bên', 'SPA_03209', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3195, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Megophrys', NULL, 'GEN_1187', 'megophryslongipes', 'Megophrys longipes', 'Boulenger', 'Cóc bùn', 'SPA_03210', 'Gọi cóc gai mắt vì ngoài bờ mi mặt trên có một mấu ngắn có dạng gai nhỏ lồi ra ngoài. Mõm các góc cạnh và dài hơn hàm dưới. Ở mỗi bên đầu có một nếp da kéo từ mắt xuống đến vai, có hai đôi nếp da mảnh từ vai nhập lại ở phía sau thân cho đến chân lỗ huyệt. Trên ầu: ngang giữa hai mắt có một vệt sẫm hình tam giác. Lưng màu xám có những vạch ngang màu sẫm ở các chân. Chiều dài thân khoảng 47 đến 65 mm. Cóc gai mắt đẻ trứng vào mùa hè, đẻ 10 - 12 trứng trên lá cây ẩm ướt cũng như đám lá rêu ở thân cây và nòng nọc phát triển trực tiếp trong trứng chứ không phát triển ở ngoài môi trường nước như các loài ếch nhái khác. Cóc gai mắt sống ở vùng rừng núi, ban ngày ẩn dưới những tầng đất đá hoặc ẩn trong các hang hốc dới hốc cây hoặc ở bờ đốc dưới đống lá cây rụng ở những nơi tối, khi bị động chúng nhảy ra ngoài nhưng vì loá mắt nên rễ mất phương hướng. Chúng có màu sắc dễ thay đổi.', NULL, 'Việt Nam: Hà Giang, Tuyên Quang, Cao Bằng, Lạng Sơn, Vĩnh Phúc (Tam Đảo), Hà Tây, Hoà Bình, Bắc Giang (Thăng Long), Thừa Thiên Huế (Bạch Mã). Thế giới: Thái Lan, Campuchia, Malaixia.', NULL, NULL, 'Cóc gai mắt có giá trị khoa học nhằm nghiên cứu tiến hóa và phát sinh chủng loài các loài lưỡng cư ở Việt Nam và thế giới.', 'T', NULL, NULL, 'VnCreature'),
(3196, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Megophrys', NULL, 'GEN_1187', 'megophrysmajor', 'Megophrys major', 'Boulenger, 1908            ', 'Cóc mày lớn', 'SPA_03211', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3197, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Megophrys', NULL, 'GEN_1187', 'megophrysmicrostoma', 'Megophrys microstoma', '(Boulenger, 1903)', 'Cóc núi miệng nhỏ', 'SPA_03212', 'Chiều dài từ mút mõm đến lỗ huyệt 28.1 mm ở con đực, 37.1 mm ở con cái. Đầu dài hơn rộng. Rộng đầu 8.2 mm ở con đực và 10 mm ở con cái. Dài đầu 7.3 mm ở con đực và 9.6 mm ở con cái. Mõm nhọn. Mắt lớn hơn mõm ở con đực (Dài mắt 3.3 mm, dài mõm 2.4 mm) nhưng mắt nhỏ hơn mõm ở con cái (dài mắt 3 mm. Dài mõm 3.1 mm). Đồng tử có khuôn. Lưỡi không phải hình chữ V. Răng lá mía tiêu biến. Màng nhĩ không rõ. Nếp màng nhĩ rõ. Sừng da nằm ngay mép ngoài của mí mắt trên. Chân trước hơi mảnh. Dài cẳng chân trước 12.2 mm ở con đực và 15.7 mm ở con cái. Ngón chân không có riềm da, không có màng bơi. Củ bàn chân trong hình bầu dục, dẹt. Chân sau mảnh. Dài đùi 12 mm, dài ống chân 13.9 mm ở con đực, còn con cái theo thứ tự là 16.7 mm và 16.2 mm. Khớp cổ chân chạm mắt. Ngón cái không có riềm da. Công thức màng bơi I2 - 3II2 - 3III2 - 3/4 1 IV3/41  - 2V.', NULL, 'Trong nước: Hà Giang, Lào Cai, Dak Lak. Lâm Đồng. Loài mới được ghi nhận ở Việt Nam năm 2023.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=1&loai=1&ID=6253'),
(3198, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Megophrys', NULL, 'GEN_1187', 'megophrysminor', 'Megophrys minor', '(Stejneger, 1926)', NULL, 'SPA_03213', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3199, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Megophrys', NULL, 'GEN_1187', 'megophryspachyprocta', 'Megophrys pachyprocta', 'Huang, 1981.', NULL, 'SPA_03214', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3200, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Megophrys', NULL, 'GEN_1187', 'megophryspalpralespinosus', 'Megophrys palpralespinosus', '(Bourret, 1937)', 'Cóc mày gai mí', 'SPA_03215', 'Đầu và trên lưng có nhiều mụn nhỏ sần sùi. Trên mỗi mi mắt có một gai và nhiều mụn nhỏ. Có nếp da hình chữ V ngược giữa lưng và nhiều nếp ngắn rải rác trên lưng và sườn. Trên đầu có một vạch rộng màu xanh vàng nằm ngang chiếm nửa mi mắt trên. Trên mỗi bên vai có một vệt lớn. Lưng màu xanh lục thẫm mốc trắng lốm đốm như vỏ cây. Phần dưới của lưng có một vệt hình thoi giới hạn bởi nếp da hình chữ V ngược. Dài thân cá thể đực: 36,5 mm; cá thể cái: 41mm. Sống ở các khu vực bờ nước, ven suối ở các khu rừng thường xanh núi cao từ 900 -2.800m.', NULL, 'Trong nước: Hà Giang (Tây Côn Lĩnh), Cao Bằng (Nguyên Bình), Lào Cai (Vườn quốc gia Hoàng Liên), Vĩnh Phúc (Tam Đảo), Gia Lai (Kon Ka Kinh). Thế giới: Trung Quốc (Vân Nam)', NULL, NULL, 'Có giá trị khoa học cao, loài hiếm, ít gặp.', 'CR', NULL, NULL, 'Vn Creature'),
(3201, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Megophrys', NULL, 'GEN_1187', 'megophrysparva', 'Megophrys parva', '(Boulenger, 1893)            ', 'Cóc mắt bé', 'SPA_03216', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3202, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Megophrys', NULL, 'GEN_1187', 'megophryssapa', 'Megophrys sapa', 'District', 'Cóc mày Sapa', 'SPA_03217', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3203, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Ophryophryne', NULL, 'GEN_1382', 'ophryophryneelfina', 'Ophryophryne elfina', 'Poyarkov Jr., Duong, Orlov, Gogoleva, Vassilieva, Nguyen, Nguyen, Nguyen, Che & Mahony, 2017', 'Cóc núi Elfin', 'SPA_03218', 'đây là một trong những loài cóc nhỏ nhất từng được mô tả với chiều dài khoảng 3cm và có hình giống sừng ở phía trên của mắt.', NULL, 'Loài Ophryophryne elfina sống ở vùng rừng rậm á nhiệt đới ở độ cao trên 1.800m, sườn bắc và đông cao nguyên Langbiang, dãy Nam Trường Sơn – một khu vực có độ đa dạng sinh học cao.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3204, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Ophryophryne', NULL, 'GEN_1382', 'ophryophrynegerti', 'Ophryophryne gerti', 'Ohler, 2003', 'Cóc núi Gert', 'SPA_03219', 'Đặc điểm nhận dạng:\n\nKích thước nhỏ, chiều dài từ mút mõm đến lỗ huyệt là 28.2 - 29.7mm. Đầu rộng hơn dài (Rộng đầu 8.5 - 8.9 mm, dài đầu 8.1 - 8.7 mm). Mõm sụt, nhô ra, ngắn hơn đường kích ngang của mắt (dài mõm 2.6 - 2.7 mm, đường kính mắt 3.2 - 3.7 mm). Mô góc mắt tròn, vùng má phồng ra. Khoảng cách gian ổ mắt hẹp hơn mí mắt trên và khoảng cách giữa hai lỗ mũi. (IOD 4.0 - 4.3 mm, UEW 2.6 - 2.7 mm, IND2.5 - 2.7 mm). Vảy mũi gần mắt hơn đỉnh mõm (EN 1.1 - 1.4 mm, SN 1.2 - 1.5 mm). Đồng tử tròn. Màng nhĩ hình bầu dục, lớn hơn một nửa đường kính mắt và khoảng cách màng nhĩ - mắt (TD 1.8 - 2.3 mm, TYE 1.5 - 1.9 mm). Nếp gấp trên màng nhĩ rõ. Răng xương lá mía tiêu biến. Lưỡi tròn ở phía sau. Chân trước có kích thước FAL 6.5 - 7.4 mm, HAL 7.5 - 7.6 mm. Ngón chân không có màng, chiều dài các ngón có môi liên hệ như sau: I<II=IV<III. Đầu ngón chân tròn, không có đĩa đệm. Ngón ngoài rìa da tiêu biến. Mấu khớp phụ tiêu biến. Mấu gan bàn chân không rõ. Các chân sau có đùi dài hơn ống chân và bàn chân. (FML 15.3 - 18.7 mm, TBL 14.9 - 15.2 mm,FTL 12.7 - 13.3 mm). Ngón cái dài và mảnh,  khác biệt số đo chiều dài giữa các ngón như sau: I<II<V<III<IV. Đầu ngón cái tròn. Có màng đáy. Ngón cái ngoài rìa da tiêu biến. Mấu Mấu khớp phụ tiêu biến. Mấu xương đốt bàn chân trong nhỏ (IMT1.4 - 1.5 mm). Mấu xương đốt bàn chân ngoài tiêu biến. Nếp xương cổ chân tiêu biến.\n\nDa của đầu, thân và chân sần sùi nổi hạt. Lưng có một vài ụ da tạo thành hình chữ X ở giữa và hai ụ da khác chạy từ sau màng nhĩ đến sau lưng. Mặt bên của đầu và hông sần sùi nổi hạt. Phần trên của hông có một vài mụn tuyến. Sừng ổ mắt nhọn. Nếp lưng bên tiêu biến. Họng, ngực, bụng và mặt bụng của chân mềm mượt. Ngực và đùi có hạch nhỏ\n\nMàu sắc tự nhiên: Mặt lưng của đầu và thân màu nâu sậm. Có hoa văn hình tam giác tối màu giữa mắt. Phần dưới hông có đốm nâu sậm. Mặt bên của đầu màu nâu sậm. Mặt lưng của chân có vạch tối màu. Họng, ngực, bụng và mặt bụng của chân màu nâu sậm kèm đốm đen.\n\nSinh học, sinh thái:\n\nCác cá thể trưởng thành sống ở các khu vực ẩm ướt gần các con suối chảy ở các khu vực rừng thường xanh núi cao. Ban ngày chúng ẩn mình và kiếm ăn ban đêm khi có các cơn mưa. Đẻ trứng ở các hốc nước ven suối, ấu trùng ăn các loài thực vật dưới nước và trải qua các giai đoạn biến thái hoàn toàn trước khi lên bờ', NULL, 'Mới chỉ phát hiện ở Khu bảo tồn thiên nhiên Hòn Bà, Khánh Hoà năm 2003.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3205, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Ophryophryne', NULL, 'GEN_1382', 'ophryophrynehansi', 'Ophryophryne hansi', 'Ohler, 2003            ', 'Cóc núi han ', 'SPA_03220', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3206, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Ophryophryne', NULL, 'GEN_1382', 'ophryophrynemicrostoma', 'Ophryophryne microstoma', 'Boulenger', 'Cóc núi', 'SPA_03221', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3207, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Ophryophryne', NULL, 'GEN_1382', 'ophryophrynepachyproctus', 'Ophryophryne pachyproctus', 'Kou, 1985            ', 'Cóc núi', 'SPA_03222', 'Loài lưỡng cư có kích thước nhỏ, con đực 32,2 - 38,6 mm, con cái lớn hơn con đực 45,3 - 47,8mm. lưng màu nâu sáng, có một hình tam giác sẫm giữa hai mắt. Trên mí mắt có gai nhọn, gai rất rõ, màng nhĩ khá rõ và lớn bằng ½ đường kính mắt. Ngón tay dài, đầu các ngón có màu trắng, phình ra ở đầu ngón. Hai bên sườn có nhiều những mụn nhỏ không đều kéo dài xuống sát phần bụng. Bụng màu trắng nhạt.', NULL, 'Việt Nam: Loài này phân bố ở Hoà Bình, Ninh Bình, Tuyên Quang, Vĩnh Phúc, Nghệ An, Hà Tĩnh. Ngoài ra chúng còn gặp ở Kontum trên độ cao 1.7m. Thế giới: Vân Nam, Quảng Đông Trung Quốc, Lào.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=7&loai=1&ID=5957'),
(3208, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Ophryophryne', NULL, 'GEN_1382', 'ophryophrynesynoria', 'Ophryophryne synoria', 'Stuart [fr], Sok, and Neang, 2006', '  ', 'SPA_03223', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3209, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Xenophrys', NULL, 'GEN_2052', 'xenophryslongipes', 'Xenophrys longipes', '(Boulenger, 1886)', 'Cóc mày chân dài ', 'SPA_03224', 'Đặc điểm nhận dạng:\n\nGọi cóc gai mắt vì ngoài bờ mi mặt trên có một mấu ngắn có dạng gai nhỏ lồi ra ngoài. Mõm các góc cạnh và dài hơn hàm dưới. Ở mỗi bên đầu có một nếp da kéo từ mắt xuống đến vai, có hai đôi nếp da mảnh từ vai nhập lại ở phía sau thân cho đến chân lỗ huyệt. Trên ầu: ngang giữa hai mắt có một vệt sẫm hình tam giác. Lưng màu xám có những vạch ngang màu sẫm ở các chân. Chiều dài thân khoảng 47 đến 65 mm.\n\nSinh học, sinh thái:\n\nCóc gai mắt đẻ trứng vào mùa hè, đẻ 10 - 12 trứng trên lá cây ẩm ướt cũng như đám lá rêu ở thân cây và nòng nọc phát triển trực tiếp trong trứng chứ không phát triển ở ngoài môi trường nước như các loài ếch nhái khác. Cóc gai mắt sống ở vùng rừng núi, ban ngày ẩn dưới những tầng đất đá hoặc ẩn trong các hang hốc dới hốc cây hoặc ở bờ đốc dưới đống lá cây rụng ở những nơi tối, khi bị động chúng nhảy ra ngoài nhưng vì loá mắt nên rễ mất phương hướng. Chúng có màu sắc dễ thay đổi.', NULL, 'Việt Nam: Hà Giang, Tuyên Quang, Cao Bằng, Lạng Sơn, Vĩnh Phúc (Tam Đảo), Hà Tây, Hoà Bình, Bắc Giang (Thăng Long), Thừa Thiên Huế (Bạch Mã).\n\nThế giới: Thái Lan, Campuchia, Malaixia.', NULL, NULL, 'Cóc gai mắt có giá trị khoa học nhằm nghiên cứu tiến hóa và phát sinh chủng loài các loài lưỡng cư ở Việt Nam và thế giới.', 'T', NULL, NULL, NULL),
(3210, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Xenophrys', NULL, 'GEN_2052', 'xenophrysmajor', 'Xenophrys major', 'Boulenger, 1908', 'Cóc mắt bên', 'SPA_03225', 'Mẫu vật nghiên cứu: Một cá thể đực TYT 2012.46 (SVL 69,63 mm), một cá thể cái trưởng thành TYT 2012.45 (SVL 64,34 mm). Cơ thể dẹp; đầu rộng hơn dài (HL 25,04-27,07 mm, HW 25,84-27,63 mm); mõm ngắn, tù, nhô về phía trước so với hàm dưới; lưỡi tròn, hơi khía lõm ở phía sau; con ngươi dọc; có gai da nhỏ trên mí mắt; chiều rộng mí mắt trên hẹp hơn khoảng cách gian ổ mắt (UEW 6,1-6,98 mm, IOD 8,12-8,49 mm); màng nhĩ rõ, cách xa ổ mắt; đường kính màng nhĩ bằng nửa đường kính mắt (TD 5,33-5,43 mm, ED 9,09-10,59 mm); gờ da trên màng nhĩ rõ; răng lá mía dài, xếp gần thẳng, chạm bờ trước lỗ mũi trong; con đực có túi kêu lớn.\n\nChi trung bình, các ngón dài; ngón chân 1/4 có màng bơi; củ bàn trong hình bầu dục, dẹp; không có củ bàn ngoài; củ khớp dưới ngón không rõ hoặc không có; khi gập dọc thân khớp cổ-bàn chạm giữa mắt.Thân màu xám hoặc nâu đỏ; có một vệt sẫm màu hình tam giác ở giữa hai mí mắt trên, đỉnh hướng về phía sau; mõm và vùng sau mắt và màng nhĩ màu đen, có vệt trắng đứt đoạn từ sau mũi đến hàm; cằm và họng màu đen nhạt với vệt trắng mảnh ở mép kéo xuống; hai bên sườn phía dưới nếp da bên nổi các hạt màu trắng; đùi và các ống chân có các vệt sẫm, mảnh, vắt ngang; mặt dưới cổ chân và bàn chân màu đen. Bụng và dưới đùi màu trắng bẩn với các vết loang lổ. Sống trong các khu rừng thường xanh còn tốt thuộc các vùng núi cao ở độ cao 600m (VQG Ba Vì) đến 2000m (VQG Bi Đúp - Núi Bà). Xuất hiện vào buổi tồi sau cơn mưa. Thức ăn là các loài côn trùng, giun đất, bọ cánh cứng xuất hiện nơi chúng sinh sống và kiếm ăn.', NULL, 'Lào Cai, Hà Giang, Tuyên Quang, Cao Bằng, Bắc Kạn, Lạng Sơn, Bắc Giang, Vĩnh Phúc, Sơn La, Hòa Bình, Hà Tây (cũ), Thanh Hóa, Nghệ An, Hà Tĩnh, Quảng Bình, Quảng Trị, Thừa Thiên-Huế, Quảng Nam, Kon Tum, Gia Lai, Đắk Lắk, Đồng Nai. Ấn Độ, Bangladesh, Trung Quốc, Mi-an-ma, Lào, Thái Lan.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3211, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Xenophrys', NULL, 'GEN_2052', 'xenophrysminor', 'Xenophrys minor', 'Stejneger, 1926', 'Cóc mắt nhỏ', 'SPA_03226', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3212, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Xenophrys', NULL, 'GEN_2052', 'xenophryspachyproctus', 'Xenophrys pachyproctus', '(Huang, 1981)', 'Cóc mày gai mí ', 'SPA_03227', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3213, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Megophryidae', 'Cóc Bùn', 'FAM_237', 'Xenophrys', NULL, 'GEN_2052', 'xenophryspalpebralespinosa', 'Xenophrys palpebralespinosa', '(Bourret, 1937)', 'Cóc mày gai mí', 'SPA_03228', 'Đầu và trên lưng có nhiều mụn nhỏ sần sùi. Trên mỗi mi mắt có một gai và nhiều mụn nhỏ. Có nếp da hình chữ V ngược giữa lưng và nhiều nếp ngắn rải rác trên lưng và sườn. Trên đầu có một vạch rộng màu xanh vàng nằm ngang chiếm nửa mi mắt trên. Trên mỗi bên vai có một vệt lớn. Lưng màu xanh lục thẫm mốc trắng lốm đốm như vỏ cây. Phần dưới của lưng có một vệt hình thoi giới hạn bởi nếp da hình chữ V ngược. Dài thân cá thể đực: 36,5 mm; cá thể cái: 41mm.', NULL, 'Trong nước: Hà Giang (Tây Côn Lĩnh), Cao Bằng (Nguyên Bình), Lào Cai (Vườn quốc gia Hoàng Liên), Vĩnh Phúc (Tam Đảo), Gia Lai (Kon Ka Kinh).', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5098'),
(3214, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Calluella', NULL, 'GEN_0291', 'calluellaguttulata', 'Calluella guttulata', '(Blyth, 1855)', 'Ếnh ương đốm', 'SPA_03229', 'Loài lưỡng cư có kích thược nhỏ so với các loài thuộc giống Calluella ở Việt Nam. Chiều dài từ mút mõm đến lỗ huyệt 36,2 - 42,7 mm ở con đực và 38,5, 45,5 mm ở con cái. đầu rộng hơn dài (HL/HW 0,74-0,78); màng nhĩ ẩn, gờ da trên màng nhĩ rõ. Chi sau: ngắn (TbL/SVL 0,39-0,44; FeL/SVL 0,40- 0,43), màng bơi giữa các ngón chân có khoảng ¼; mút các ngón nhọn. Trong tự nhiên: mặt lƣng màu đỏ nâu với các vân và đốm màu xám đen; có một đốm sẫm màu, hình tam giác nối giữa hai ổ mắt, phía sau có các sọc sẫm màu; bụng màu kem hoặc vàng nhạt.', NULL, 'Loài lưỡng cư có kích thược nhỏ so với các loài thuộc giống Calluella ở Việt Nam. Chiều dài từ mút mõm đến lỗ huyệt 36,2 - 42,7 mm ở con đực và 38,5, 45,5 mm ở con cái. đầu rộng hơn dài (HL/HW 0,74-0,78); màng nhĩ ẩn, gờ da trên màng nhĩ rõ. Chi sau: ngắn (TbL/SVL 0,39-0,44; FeL/SVL 0,40- 0,43), màng bơi giữa các ngón chân có khoảng ¼; mút các ngón nhọn. Trong tự nhiên: mặt lƣng màu đỏ nâu với các vân và đốm màu xám đen; có một đốm sẫm màu, hình tam giác nối giữa hai ổ mắt, phía sau có các sọc sẫm màu; bụng màu kem hoặc vàng nhạt.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5799'),
(3215, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Glyphoglossus', NULL, 'GEN_0768', 'glyphoglossusmolossus', 'Glyphoglossus molossus', 'Günther, 1868', 'Nhái lưỡi', 'SPA_03230', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3216, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Kalophrynus', NULL, 'GEN_0990', 'kalophrynusinterlineatus', 'Kalophrynus interlineatus', '(Blyth, 1855)            ', 'Nhái cóc đốm', 'SPA_03231', 'Loài lưỡng cư có kích thước lớn trong họ nhái bầu, thân dài khoảng 35 - 55mm. Cơ thể hình tam giác, đầu nhỏ, mõm nhọn, da xù xì với những mụn cóc nhỏ li ti phân bố dày đều trên mặt lưng. Mặt lưng phẳng  hân cách rõ gới sườn bằng một đường gờ sắc cạnh. Trên lưng gần phía đùi có hai đốm màu đen lớn rất rõ và các đốm đen nhỏ khác rải rác trên lưng. Mõm nhọn; gờ mõm tù, vùng má gần phẳng, thẳng đứng; miệng hẹp, mõm dài hơn một chút so với mắt (SL 4,78 mm, ED 4,34 mm); mắt bé, con ngươi nằm ngang; lỗ mũi nằm gần mút mõm hơn so với mắt, khoảng cách gian mắt rộng hơn so với mí mắt trên (IOD 4,85 mm, UEW 2,77 mm); màng nhĩ rõ, bằng 2/3 của đường kính mắt (TD 2,73 mm, ED 4,34 mm); gờ da trên màng nhĩ rõ; răng lá mía xếp xiên, gần chạm mép dưới lỗ mũi trong; lưới dài hẹp, tròn ở phía sau.\n\nNgón tay hoàn toàn tự do; ngón chân 1/4 có màng, mút các ngón tù; củ bàn trong và củ bàn ngoài tròn, kích thước tương đương; củ khớp dưới các ngón tay và ngón chân lồi, rõ; khi gập dọc thân khớp chày-cổ chạm vai, khớp cổ-bàn chạm đến mắt. Thân có nhiều nốt sần, các nốt sần ở vùng mõm nhỏ, ở lưng, bụng và các chi lớn hơn. Thân màu nâu vàng, có các đốm sáng hơn dọc theo sườn từ sau mắt đến gốc đùi; màng nhĩ, vai và hai bên sườn màu nâu sẫm; cằm và họng sáng màu hơn. Có hai đốm đen sẫm ở phía lưng, phần tiếp giáp với bẹn; bụng màu trắng đục Loài này thường sống phổ biến ở trong rừng rậm còn tốt hay rừng thứ sinh ở các khu vực thấp cho đến độ cao 1500m ở Darlak và chúng thường xuất hiện vào những cơn mưa đầu mùa ở vùng miền Đông nam bộ để giao phối và đẻ trứng. Sau đó không còn gặp chúng khi nước lên cao. Vào mùa giao phối khi đụng vào cơ thể thường tiêt ra một chấy nhày màu vàng rất dính. Thức ăn của loài này là các loài côn trùng nhỏ như kiến, mối. Mùa sinh sản từ tháng 3 - 5 hàng năm , chúng đẻ trứng thành những đám nhỏ nổi trên các vũng nước đọng.', NULL, 'Vệt Nam: loài này có vùng phân bố ở Cao Bằng, Ninh Bình, Darklak, Đồng Nai, Bình Phước. Thế giới: Cambodia; Trung Quốc; Hongkong; Lào; Myanmar; Thailand.', NULL, NULL, NULL, NULL, NULL, NULL, 'Vn Creature'),
(3217, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Kaloula', NULL, 'GEN_0991', 'kaloulapulchra', 'Kaloula pulchra', 'Gray, 1831            ', 'Ễnh ương', 'SPA_03232', 'Loài lưỡng cư có đầu nhỏ, miệng hẹp, thân bầu và mập. Dài thân khoảng 70 - 80mm. Lưng màu nâu, ngang mắt có vạch vàng. Mỗi bên thân là một vạch rộng màu nâu sáng , vàng hay hơi hồng chạy từ sau mắt đến háng. Đầu ngón tay phình với đĩa ngón tay bị xén ngang. Chân rất ngắn, thậm chí có khi chân vuông góc với thân, gót cách nhau đến 10mm. Khi đụng vào cơ thể chúng loài này tiết ra chất nhờn rất dính và khó rửa sạch Loài này thường sống phổ biến ở vùng trung du và miền núi. Ở các khu vực độ cao trên 400m chúng sống trong các bọng nước trên cây và có khả năng leo trèo. Chỉ xuất hiện vào 2 tháng đầu mùa mưa kiếm ăn và giao phối. Thời gian còn lại chúng ngủ triền miên trong hang đất hoặc các hốc cây, hốc đá ... Thức ăn của loài này là các loài côn trùng nhỏ như kiến, mối. Mùa sinh sản từ tháng 3 - 5 hàng năm, khi ghép đôi chúng thường kêu rất to và vang khắp.', NULL, 'Đây là loài có vùng phân bố rất rộng và hầu khắp ở Việt Nam Lạng Sơn, Ninh Bình, Hà Nội (Ba Vì), Huế, Kontum, Gia Lai và ở Đồng Nai, Bà Rịa - Vũng Tàu (Núi Dinh) đến Kiên Giang. ', NULL, NULL, 'Là loài khá phổ biến và số lượng còn nhiều do không bị săn bắt làm thức ăn. Có giá trị nghiên cứu khoa học về sinh thái và tập tính của loài.', NULL, NULL, NULL, 'Vn Creature'),
(3218, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Microhyla', NULL, 'GEN_1221', 'microhylaannamensis', 'Microhyla annamensis', 'Smith, 1923', 'Nhái bầu Trung bộ', 'SPA_03233', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3219, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Microhyla', NULL, 'GEN_1221', 'microhylaberdmorei', 'Microhyla berdmorei', '(Blyth, 1856)            ', 'Nhái bầu Bec mơ', 'SPA_03234', 'Con đực phát triển đến chiều dài mõm-lỗ thông 25–28 mm (0,98–1,10 in) và con cái dài 27–45 mm (1,1–1,8 in). Chúng có bụng màu vàng đặc trưng. Chúng có đôi chân tương đối dài và có thể thực hiện những cú nhảy ấn tượng. Nòng nọc có chiều dài lên tới 23 mm (0,91 in).', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3220, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Microhyla', NULL, 'GEN_1221', 'microhylabutleri', 'Microhyla butleri', 'Boulenger, 1900            ', 'Nhái bầu Bất lơ', 'SPA_03235', 'Có làn da mịn màng hoặc có mụn cóc nhỏ mịn ở trên. Chúng có màu nâu trên lưng, màu đỏ nhạt ở hai bên và các chi, bên dưới màu trắng. Con đực phát triển tới chiều dài lỗ huyệt ở mõm là 21–23 mm (0,83–0,91 in) và con cái là 23–26 mm (0,91–1,02 in)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3221, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Microhyla', NULL, 'GEN_1221', 'microhylafissipes', 'Microhyla fissipes', '(Boulenger, 1884)            ', 'Nhái bầu hoa', 'SPA_03236', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3222, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Microhyla', NULL, 'GEN_1221', 'microhylaheymonsi', 'Microhyla heymonsi', '(Vogt,1991)', 'Nhái bầu Hây - môn', 'SPA_03237', 'Mẫu vật nghiên cứu: Ba cá thể cái trưởng thành TYT 2010.27 (SVL 22,43 mm), TYT 2010.32 (SVL 24,17 mm), TYT 2010.33 (SVL 25,87 mm) thu vào tháng 6/2010 và một cá thể đực trưởng thành TYT 2012.17 (SVL 21,52 mm). Loài lưỡng cư có kích thước nhỏ trong họ nhái bầu. Thân mảnh, có dạng hình tam giác; đầu rộng hơn dài (HW 5,86-8,1 mm; HL 5,56-7,44 mm) mõm hơi tròn, dài hơn một chút so với đường kính mắt (SL 3,18-3,38 mm, ED 2,12-2,36 mm); vùng má hơi xiên; lỗ mũi nằm gần mút mõm hơn so với mắt; khoảng cách gian mũi tương đương với khoảng cách gian ổ mắt và rộng hơn so với mí mắt trên (IND 2,22-2,49 mm, IOD 2,13-2,62 mm, UEW 1,38-1,64 mm); không có răng lá mía; lưỡi dài, tròn ở phía sau; màng nhĩ ẩn.\nCác ngón tay tự do; chi sau dài, củ khớp dưới ngón rõ; củ bàn trong và củ bàn ngoài bé; ngón chân có màng bơi nhưng không phát triển; khi gập dọc thân khớp chày-cổ chạm gần đến mút mõm. Thân màu vàng đến nâu xám nhạt với các vệt sẫm hơn ở trên lưng, các vệt sẫm hai bên đối diện nhau; giữa lưng có vệt trắng mảnh với một đốm đen nhỏ; mỗi bên thân với vệt đen sẫm kéo dài từ mõm, ngang qua mắt dọc 2 bên sườn tới bẹn; mặt bên chi sau có các vệt ngang, mảnh, sẫm màu. Loài này thường sống phổ biến ở vùng trung du và miền núi, trong các bãi cỏ ven rừng, các thung lũng, ruộng ẩm, ven các vũng nước chổ có các loại thực vật mục nát và thường sống trên cạn. Thức ăn của loài này là các loài côn trùng nhỏ như kiến, mối. Mùa sinh sản từ tháng 3 - 5 hàng năm , chúng đẻ trứng thành những đám nhỏ nổi trên các vũng nước đọng.', NULL, 'Đây là loài có vùng phân bố rất rộng và hầu khắp ở Việt Nam Lạng Sơn, Ninh Bình, Hà Nội (Ba Vì), Huế, Kontum, Gia Lai và ở Đồng Nai, Bà Rịa - Vũng Tàu (Núi Dinh). ', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3223, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Microhyla', NULL, 'GEN_1221', 'microhylainornata', 'Microhyla inornata', '(Boulenger, 1980)', 'Nhái bầu trơn', 'SPA_03238', 'Loài lưỡng cư có kích thước nhỏ trong họ Nhái bầu Microhylidae, (SVL 18,3 - 23,6mm) đầu ngắn, dài hơn rộng (HL 8,19 - 9,7mm, HW 7,42 - 8,04mm), mõm nhọn, mõm nhọn, thân thon dài, các chi mảnh không có màng bơi. Ngón tay không có màng bơi, mút ngón có đĩa bám phát triển, ngón tay I ngắn hơn II; ngón chân sau có màng bơi rất nhỏ, mút ngón có đĩa phát triển; khi gập dọc thân khớp cổ, chày chạm mắt hay vượt qua mắt một chút. Lưng màu nâu vàng hoặc xám vàng. Một số cá thể trên lưng có từ 6 - 15 đốm màu đen khá lớn. Có một vệt đen lớn kéo dài từ mút mõm qua mắt tới nách, Chân trước và chân sau có màu vàng với những mảng viền mau đen. Bụng, cổ là những mảng màu đen trắng không đều Loài này thường sống trên các nền rừng ẩm ướt dưới các thảm mục thực vật trong rừng thường xanh hoặc những nơi rừng lồ ồ. Xuất hiện vào tháng 4 đến tháng 6 với số lượng khá lớn tiếng kêu nhỏ và dài, thường xuất hiện sau những cơn mưa\n\nThức ăn của loài này là các loài côn trùng nhỏ.', NULL, 'Việt Nam: vùng phân bố ở Ninh Bình, Hà Nội (Ba Vì) Gia Lai và ở Đồng Nai, Lâm Đồng, Bình Phước Thế giới: Cambodia, Trung Quốc, Ấn Độ, Indonesia, Lào, Malaysia, Thailand.', NULL, NULL, NULL, NULL, NULL, NULL, 'Vn Creature'),
(3224, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Microhyla', NULL, 'GEN_1221', 'microhylamarmorata', 'Microhyla marmorata', ' (Bain et Nguyen, 2004)', 'Nhái bầu hoa cương', 'SPA_03239', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3225, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Microhyla', NULL, 'GEN_1221', 'microhylamukhlesuri', 'Microhyla mukhlesuri', 'Hasan, Islam, Kuramoto, Kurabayashi &Sumida, 2014', 'Nhái bầu múk- le-su-ri', 'SPA_03240', 'Microhyla mukhlesuri là một loài ếch nhỏ có chiều dài lỗ mũi từ 16,5 - 21 mm ở con đực và 17,3 - 18,4 mm ở con cái. Chiều dài đầu gần bằng chiều rộng đầu. Mõm của nó tròn và lỗ mũi gần chóp mõm hơn mắt. Khoảng giữa các hốc mắt rộng hơn khoảng giữa các lỗ mũi. Da mịn màng. Các ngón tay thon không có màng và có công thức chiều dài ngón tay tương đối là 1 > 4 > 2 > 3. Khớp chày chày dài từ mắt đến chóp mõm và chiều dài chi sau lớn hơn chiều dài mõm-lỗ khoảng 1,6 lần . Chiều dài xương đùi ngắn hơn chiều dài xương chày. Có một lớp màng thô sơ giữa các ngón chân và chiều dài ngón chân tương đối chính thức là 1 > 2 > 5 > 3 > 4. Cả đầu ngón tay và đầu ngón chân đều không được mở rộng (Hasan và cộng sự 2014).', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://amphibiaweb.org/species/8124'),
(3226, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Microhyla', NULL, 'GEN_1221', 'microhylaornata', 'Microhyla ornata', '(Dumeril et Bibron, 1841)', 'Nhái bầu hoa', 'SPA_03241', 'Nhái cỡ nhỏ có thân dài 18 - 28mm.Mõm hơi nhọn, vượt qua hàm dưới. Gờ mõm không rõ. Vùng má hơi lõm, mắt bé, đường kính mắt bằng bề rộng của mí mắt trên. Ngón tay hoàn toàn tự do, mút ngón tù. Ngón I ngắn hơn ngón II. các ngón chân không có đĩa, màng da kém 1/2 ngón. Củ ngoài lớn hơn củ bàn trong. Khớp chày, cổ chân chưa đến mắt. Thân màu nâu xám, trên lưng có những đốm dạng nâu sẫm, đối xứng qua trục thân, kéo dài từ sau mắt đến cuối thân, thắt lại ở vùng vai và phía cuối. Đôi khi có một vài sọc trắng rất mảnh ở giữa lưng, nhỏ hơn sọc trắng ở loài Nhái bầu hây môn - Microhyla haymonsi. Bụng màu trắng đục, cằm và họng màu nâu hồng Giống như loài nhái bầu vân Microhyla pulchra. Nhái bầu hoa tuy nhỏ nhưng nhờ có túi kêu lớn là nhờ cơ quan cộng hưởng ở cổ, nên kêu to và vang xa. Chúng thường chỉ xuất hiện vào mùa mưa hàng năm ở các khu vực rừng còn tốt tới độ cao 2000m. Thỉnh thoảng cũng gặp ở một vài vùng khu đất nông nghiệp. Thức ăn chủ yếu của chúng là kiến, mối, côn trùng đất.', NULL, 'Việt Nam: Loài này phân bố ở miền Bắc vào đến Gia Lai, Kontum, Đắc Lắc, Lâm Đồng tới độ cao 1.600 - 1.800m. Thế giới: Bangladesh; Bhutan; India; Nepal; Pakistan; Sri Lanka', NULL, NULL, NULL, NULL, NULL, NULL, 'Vn Creature'),
(3227, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Microhyla', NULL, 'GEN_1221', 'microhylapicta', 'Microhyla picta', 'Schenkel, 1901', 'Nhái bầu vẽ', 'SPA_03242', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3228, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Microhyla', NULL, 'GEN_1221', 'microhylapulchra', 'Microhyla pulchra', '(Hallowell, 1861)            ', 'Nhái bầu vân', 'SPA_03243', 'Mẫu vật nghiên cứu: Một cá thể trưởng thành TYT 2010.24 (SVL 29,16 mm), hai cá thể chưa trưởng thành VH13 (SVL 17,58 mm) và TYT 2010.35 (SVL 16,11 mm). Cơ thể có kích thước trung bình, thân dạng hình tam giác; vùng má hơi xiên, mõm hơi tròn, dài hơn đường kính mắt (SL 3,87 mm, ED 2,59 mm. Con đực có túi kêu. lưỡi hình bầu dục, tròn ở phía sau; đường kính mắt rộng hơn mí mắt trên, bằng khoảng 4/5 lần chiều dài mõm (ED 2,79 mm, UEW 2,26 mm, SL 3,87 mm); lỗ mũi tròn, nằm gần mút mõm hơn so với mắt; khoảng cách gian mũi hẹp hơn khoảng cách gian ổ mắt một chút (IOD 2,98 mm); con ngươi tròn, màng nhĩ không rõ; con đực có túi kêu. Các ngón tay không có màng; các ngón 1/2 có màng bơi; củ bàn trong hình bầu dục, củ bàn ngoài tròn, màu trắng; khi gập dọc thân khớp chày-cổ chạm hay vượt mắt một chút.\n\nThân màu nâu xám nhạt; trên đầu, lưng và chi sau với các hoa văn màu nâu sẫm, nhạt xen kẽ; mặt bên đầu và thân có vệt đen từ sau mắt đến gần gốc đùi; phần bẹn và phía sau đùi, ống chân có màu vàng; bụng và dưới đùi màu trắng, cằm và họng màu tối hơn. Giống như loài Nhái bầu hoa Microhyla ornata. Thường gặp ở những nơi ẩm ướt trong các khu rừng thường xanh, đồng ruộng, ven suối, vườn cây...Mùa sinh sản thường kéo dài từ tháng 3 đến tháng 6 theo vùng phân bố. Ban ngày chúng ẩn náu nơi đất trũng hay những kẽ đất, hoạt động kiếm ăn ban đêm, chỉ xuất hiện vào mùa mưa. Thức ăn chủ yếu của chúng là kiến, mối, côn trùng đất', NULL, 'Việt Nam: phân bố chủ yếu ở miền Bắc vào đến Gia Lai, Kontum, Đắc Lắc Thế giới: Cambodia; China; Hong Kong; Lào; Macao; Thailand.', NULL, NULL, NULL, NULL, NULL, NULL, 'Vn Creature'),
(3229, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Microhyla', NULL, 'GEN_1221', 'microhylasp1', 'Microhyla sp1.', NULL, 'Nhái bầu (núi đá)', 'SPA_03244', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3230, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Micryletta', NULL, 'GEN_1228', 'micrylettainornata', 'Micryletta inornata', '(Boulenger, 1890)            ', 'Nhái bầu trơn', 'SPA_03247', 'Loài lưỡng cư có kích thước nhỏ trong họ Nhái bầu Microhylidae, (SVL 18,3 - 23,6mm) đầu ngắn, dài hơn rộng (HL 8,19 - 9,7mm, HW 7,42 - 8,04mm), mõm nhọn, mõm nhọn, thân thon dài, các chi mảnh không có màng bơi. Ngón tay không có màng bơi, mút ngón có đĩa bám phát triển, ngón tay I ngắn hơn II; ngón chân sau có màng bơi rất nhỏ, mút ngón có đĩa phát triển; khi gập dọc thân khớp cổ, chày chạm mắt hay vượt qua mắt một chút. Lưng màu nâu vàng hoặc xám vàng. Một số cá thể trên lưng có từ 6 - 15 đốm màu đen khá lớn. Có một vệt đen lớn kéo dài từ mút mõm qua mắt tới nách, Chân trước và chân sau có màu vàng với những mảng viền mau đen. Bụng, cổ là những mảng màu đen trắng không đều Loài này thường sống trên các nền rừng ẩm ướt dưới các thảm mục thực vật trong rừng thường xanh hoặc những nơi rừng lồ ồ. Xuất hiện vào tháng 4 đến tháng 6 với số lượng khá lớn tiếng kêu nhỏ và dài, thường xuất hiện sau những cơn mưa\nThức ăn của loài này là các loài côn trùng nhỏ.', NULL, 'Việt Nam: vùng phân bố ở Ninh Bình, Hà Nội (Ba Vì) Gia Lai và ở Đồng Nai, Lâm Đồng, Bình Phước Thế giới: Cambodia, Trung Quốc, Ấn Độ, Indonesia, Lào, Malaysia, Thailand.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3231, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Mocrohyla', NULL, 'GEN_1242', 'mocrohylamukhlesuri', 'Mocrohyla mukhlesuri', 'Hasan, Islam, Kuramoto, Kurabayashi & Sumida, 2014', 'Nhái bầu hoa', 'SPA_03248', 'Microhyla mukhlesuri là một loài ếch nhỏ có chiều dài lỗ mũi từ 16,5 - 21 mm ở con đực và 17,3 - 18,4 mm ở con cái. Chiều dài đầu gần bằng chiều rộng đầu. Mõm của nó tròn và lỗ mũi gần chóp mõm hơn mắt. Khoảng giữa các hốc mắt rộng hơn khoảng giữa các lỗ mũi. Da mịn màng. Các ngón tay thon không có màng và có công thức chiều dài ngón tay tương đối là 1 > 4 > 2 > 3. Khớp chày chày dài từ mắt đến chóp mõm và chiều dài chi sau lớn hơn chiều dài mõm-lỗ khoảng 1,6 lần . Chiều dài xương đùi ngắn hơn chiều dài xương chày. Có một lớp màng thô sơ giữa các ngón chân và chiều dài ngón chân tương đối chính thức là 1 > 2 > 5 > 3 > 4. Cả đầu ngón tay và đầu ngón chân đều không được mở rộng (Hasan và cộng sự 2014).', NULL, 'ược mô tả lần đầu tiên ở quận Chittagong ở Đông Bắc Bangladesh và cũng có thể được tìm thấy ở phía đông bắc Ấn Độ, Việt Nam, Thái Lan, Lào, Myanmar và Malaysia. Cần phải làm việc thêm để điều chỉnh phạm vi địa lý rộng lớn này (Hasan và cộng sự 2014, Yuan và cộng sự 2016, Garg và cộng sự 2019)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://amphibiaweb.org/species/8124'),
(3232, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Microhylidae', 'Nhái Bầu', 'FAM_243', 'Nanohyla', NULL, 'GEN_1287', 'nanohylapulchella', 'Nanohyla pulchella', 'Boulenger, 1900', '  ', 'SPA_03249', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3233, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Amolops', NULL, 'GEN_0080', 'amolopschapaensis', 'Amolops chapaensis', '(Bourret, 1937). ', NULL, 'SPA_03250', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3234, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Amolops', NULL, 'GEN_0080', 'amolopschunganensis', 'Amolops chunganensis', '(Pope, 1929)', NULL, 'SPA_03251', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3235, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Amolops', NULL, 'GEN_0080', 'amolopscompotrix', 'Amolops compotrix', '(Bain, Stuart&Orlov, 2006)', 'Ếch com-po-tric', 'SPA_03252', 'Con cái có chiều dài thân 55.6 - 56.9 mm. Cơ thể hình quả thông rõ ràng. Đường kính màng nhĩ của con đực bằng với con cái. Con đực có túi kêu nhỏ dưới cổ họng. Ngón thứ nhất của chân trước ngăn hơn ngón thứ hai, không có nếp da phía trước trục ngón thứ hai và thứ ba. Đầu ngón chân sau nở rộng với đường rãnh ở mép ngoài, con đực có chiều rộng đĩa ngón thứ ba chân trước bằng ½ đường kính màng nhĩ. Chân sau có một củ bàn ngoài. Nếp gấp bên lưng mảnh, kéo dài từ góc sau của mí mắt trên đến gần huyệt. Da trên lưng trơn. Con đực không có tuyến dưới chân trước. Lưng con đực có màu xanh lá - xanh lục trong điều kiện bảo quản. Con cái có màu xanh lá - lục đến xanh lá hơi vàng, nâu dưới bụng. Trứng không màu', NULL, 'Trong nước: Loài này được phát hiện và công bố năm 2006 ở các tỉnh Kontum, Thừa Thiên Huế. Mới đấy còn ghi nhận phân bố ở Khu bảo tồn thiên nhiên Pù Hoạt, Nghệ An', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=71&loai=&ID=6200'),
(3236, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Amolops', NULL, 'GEN_0080', 'amolopsricketti', 'Amolops ricketti', '(Boulenger, 1899)', 'Ếch bám đá', 'SPA_03253', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3237, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Amolops', NULL, 'GEN_0080', 'amolopsspinapectoralis', 'Amolops spinapectoralis', 'Inger, Orlove and Darevsky, 1999', NULL, 'SPA_03254', 'Loài ếch bám đá có kích thước trung bình. Dài mút mõm đến lỗ huyệt 36.9 - 37.88 mm ở con đực và 41.64 - 45.15 mm ở con cái. Thể tạng chắc nịch. Đầu rộng hơn dài. Rộng đầu 14.34 - 16.87 mm, dài đầu 13.73 - 16.11 mm. Mõm tròn. Mắt lớn, đường kính dài hơn dài mõm và khoảng cách gian ổ mắt. Đường kính mắt 5.57 - 6.67 mm, dài mõm 5.01 - 6.19 mm, Gian ổ mắt 3.3 - 4.3 mm. Đồng tử ngang. Răng lá mía xuất hiện.', NULL, 'Loài đặc hữu ở Việt Nam, mới phát hiện năm 1999 ở Quảng Nam, Kontum, Gia Lai.', NULL, 'Loài đặc hữu ở Việt Nam, mới phát hiện năm 1999 ở Quảng Nam, Kontum, Gia Lai.', NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=26&loai=1&ID=6111'),
(3238, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Amolops', NULL, 'GEN_0080', 'amolopsviridimaculatus', 'Amolops viridimaculatus', '(Jiang, 1983)', NULL, 'SPA_03255', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3239, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Amolops', NULL, 'GEN_0080', 'amolopsvitreus', 'Amolops vitreus', '(Bain, Stuart&Orlov, 2006)', 'Ếch bám đá thủy tinh', 'SPA_03256', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3240, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Chaparana', NULL, 'GEN_0364', 'chaparanadelacouri', 'Chaparana delacouri', '(Angel, 1928). ', 'Ếch vạch', 'SPA_03257', 'Ếch vạch là một loài ếch có kích thước lớn nhất miền Bắc nước ta, dài thân 9 - 16mm, có con nặng tới 3g. Cơ thể to mập, mắt lồi rõ, phía sau mí mắt trên có một số gai nhỏ hình chóp. Một nếp da rất rõ chạy từ mắt đến vai. Trên lưng có nhiều nếp da ngắn gián đoạn, trên đùi có những nếp da dọc, trên cẳng chân có nhiều nếp da xiên. Mút ngón chân có mấu tròn rõ. Lưng mầu nâu thẫm với những vết đen tương ứng với những nếp gấp da trên lưng.', NULL, 'Trong nước: Lào Cai (Sa Pa), Bắc Kạn (Đông Phúc, Xuân Hạt), Vĩnh Phúc (Tam Đảo, Mỹ Lương), Hoà Bình (Tu Lý, Đoàn Kết, Thượng Tiến). Thế giới: Chỉ có ở Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5103'),
(3241, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Chirixalus', NULL, 'GEN_0379', 'chirixalusnongkhorensis', 'Chirixalus nongkhorensis', '(Cochran, 1927)', 'Chàng Nọng kho', 'SPA_03258', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3242, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Huia', NULL, 'GEN_0911', 'huiaandersoni', 'Huia andersoni', 'Boulenger, 1882', 'Chàng An déc sơn', 'SPA_03259', 'Huia Andersoni', NULL, 'Trong nước: Lào Cai (Sapa, Ngòi Toi), Lạng Sơn (Hữu Liên), Quảng Ninh (Pò Hèn), Vĩnh Phúc (Tam Đảo), Hoà Bình (Tu Lý, Piềng Vế), Hà Tĩnh (Hương Sơn), Thừa Thiên - Huế (Lộc Hải), Kontum (Ngọc Linh), Gia Lai (Đắk Đoa, Sơklang), Đắk Lắk (Đạo Nghĩa, Krông Pách), Lâm Đồng (Đà Lạt, Killplagnol).', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=5&loai=1&ID=5100'),
(3243, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Hylarana', NULL, 'GEN_0924', 'hylaranaandersonii', 'Hylarana andersonii', 'Boulenger, 1882', 'Chàng anderson ', 'SPA_03260', 'Đặc điểm nhận dạng:\n\nLoài ếch khá lớn, dài thân 100 - 110 mm, lưng thường có mầu xanh hay nâu hoặc phía trước xanh và hơi nâu về phía sau. Ở con đực phía sau lưng, hai bên sườn đôi khi cả trên mí mắt có những hạt nhỏ, những hạt này có cả ở vùng lỗ huyệt, ở rìa phía ngoài háng và mặt trên phía ngoài cẳng chân. ở con cái những hạt này không rõ lắm nên da chúng không ráp nhiều như ở con đực. Trên các chi đều có các vệt ngang mầu tối. Phía dưới bụng và đùi đôi khi đỏ hồng nhưng thường vàng xanh. ức thường nâu đôi khi điểm chấm sẫm. Xung quanh con ngươi mắt có một vòng tròn khá rộng màu vàng. Con đực nhỏ hơn con cái nhiều.\n\nSinh học, sinh thái:\n\nThường sống bên bờ những con suối có nước chảy mạnh, có nhiều đá trên núi cao (600 - 1200m). Khác với nhiều loài ếch nhái khác đôi khi chúng đi kiếm ăn cả ban ngày. Thức ăn của chúng thường là: châu chấu, gián rừng, cuốn chiếu... Loài ếch này bơi giỏi, có thể bơi ngược dòng suối chảy xiết. Tuy thích sống trong môi trường nước nhưng nhiều khi chúng nấp trong các bụi cây, hốc đá bên bờ suối để kiếm mồi.', NULL, 'Trong nước: Lào Cai (Sapa, Ngòi Toi), Lạng Sơn (Hữu Liên), Quảng Ninh (Pò Hèn), Vĩnh Phúc (Tam Đảo), Hoà Bình (Tu Lý, Piềng Vế), Hà Tĩnh (Hương Sơn), Thừa Thiên - Huế (Lộc Hải), Kontum (Ngọc Linh), Gia Lai (Đắk Đoa, Sơklang), Đắk Lắk (Đạo Nghĩa, Krông Pách), Lâm Đồng (Đà Lạt, Killplagnol).\n\nThế giới: Mianma, Trung Quốc, Lào, Thái Lan.', NULL, NULL, 'Được sử dụng như một nguồn thực phẩm của nhân dân vùng núi, ngoài ra còn có giá trị thẩm mỹ và khoa học.', 'VU', NULL, NULL, NULL),
(3244, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Hylarana', NULL, 'GEN_0924', 'hylaranaattigua', 'Hylarana attigua', '(Inger, Orlov & Darevsky, 1999)', 'Ếch attigua', 'SPA_03261', 'Đầu dẹp, dài hơn rộng một chút. Răng lá mía xếp xiên, gần chạm nhau ở phía sau; cách xa lỗ mũi trong; lƣỡi dài, xẻ thuỳ sâu ở phía sau. Mõm hơi nhọn, gờ mõm rõ, vùng má lõm. Mép miệng kéo dài đến sau mắt. Lỗ mũi ở phía bên, nằm gần mút mõm hơn mắt. Mắt khá lớn, gian ổ mắt bé hơn chiều rộng mí mắt trên. Màng nhĩ rõ, nằm gần sát ổ mắt; đƣờng kính màng nhĩ bằng khoảng 2/3 chiều dài ổ mắt. Ngón tay hoàn toàn tự do, ngón I dài hơn ngón II và ngón IV; ngón chân có màng hẹp, gần hoàn toàn trừ ngón IV đến đốt cuối của ngón. Mút ngón tay và ngón chân phình rộng thành đĩa với rãnh ngang hình móng ngựa, đĩa ngón tay bé hơn đĩa ngón chân. Củ khớp dƣới ngón rõ; củ bàn trong hình bầu dục, lồi, củ bàn ngoài bé hơn. Khớp chày - cổ đến trƣớc mắt, khớp cổ - bàn đạt đến mõm.\nDa sần với các hạt bé, nếp bên rất rõ. Mi mắt trên có hạt. Trên lƣng màu nâu vàng sẫm, hai bên thân nhạt hơn; vùng phía sau mắt và màng nhĩ đen; vệt trắng ở mép trên kéo dài đến phía trên vai. Chi sau màu nâu đỏ, có các vệt đen sẫm vắt ngang, màng da giữa các ngón chân đen. Kiếm ăn ban đêm, xuất hiện ở các khu vực rừng thường xanh núi cao từ 600 – 1.000m. Thức ăn là các loài côn trùng sống trong khu vực sinh sống. Đẻ trứng vào tháng mùa mưa hằng năm ở các con suối và nòng nọc phát triển ở đó.', NULL, 'Quảng Bình, Thừa Thiên-Huế - Vườn quốc gia Bạch Mã, Kontum, Gia Lai, Đắk Lắk, Lâm Đồng – Vườn quốc gia Bidoup – Núi Bà, Khánh Hòa – Khu bảo tồn thiên nhiên Hòn Bà. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3245, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Hylarana', NULL, 'GEN_0924', 'hylaranaerythraea', 'Hylarana erythraea', '(Schlegel, 1837)            ', 'Chàng xanh', 'SPA_03262', 'Cơ thể có kích thước trung bình. Răng lá mía xếp gần ngang, không chạm nhau và không chạm lỗ mũi trong; lưỡi xẻ rộng ở phía sau. Đầu dài hơn rộng; mõm hơi nhọn, gờ mõm không rõ, vùng má lõm, hơi xiên. Lỗ mũi nằm gần mút mõm hơn mắt; gian mũi bằng gian ổ mắt. Mắt lớn, đường kính mắt tương đương khoảng cách từ trước mắt đến mũi; gian ổ mắt lớn hơn chiều rộng mí mắt trên một chút. Màng nhĩ rất rõ, bằng khoảng 3/4 đường kính mắt. Các ngón tay tự do, mút các ngón tay có đĩa nhỏ, ngón I dài hơn ngón II một chút, ngón III dài nhất. Chi sau dài, khớp chày - cổ đạt đến giữa mắt và mũi, khớp cổ - bàn vượt quamõm một chút; ngón chân có màng gần hoàn toàn. Củ bàn trong hình bầu dục, dẹp.\n\nDa trên đầu, lưng và các chi nhẵn, nửa sau mặt dưới của chi sau nổi các nốt sần. Mặt trên đầu và thân màu xanh nhạt hoặc xanh nâu nhạt. Có hai vệt sáng rộng từ 2 - 3 mm kéo dài từ sau mí mắt đến hết lưng. Hai bên thân cùng màu với lưng, có hai vệt sáng bé hơn bắt đầu từ dưới màng nhĩ đến gốc đùi. Mép màu trắng, mép dưới có vệt đen nhạt. Mặt bụng màu trắng. Kiếm ăn ban đêm, xuất hiện ở các khu vực các kiểu rừng từ nguyên sinh đến thứ sinh ven suối hay kgu vực đầm lầy, các vũng nước đọng trong rừng. Thức ăn là các loài côn trùng sống trong khu vực sinh sống. Đẻ trứng vào tháng mùa mưa hằng năm ở các con suối và nòng nọc phát triển ở đó.', NULL, 'Lào Cai, Thừa Thiên-Huế, Đà Nẵng, Phú Yên, Gia Lai, Đắk Lắk,Đắk Nông, Đồng Nai, Thành phố Hồ Chí Minh, Bà Rịa - Vũng Tàu, Vĩnh Long, Kiên Giang ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3246, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Hylarana', NULL, 'GEN_0924', 'hylaranaguentheri', 'Hylarana guenteri', 'Boulenger, 1882', 'Chẫu chuộc', 'SPA_03263', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3247, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Hylarana', NULL, 'GEN_0924', 'hylaranamacrodactyla', 'Hylarana macrodactyla', 'Günther, 1858            ', 'Chàng hiu', 'SPA_03264', 'Mẫu vật nghiên cứu: Một cá thể đực TYT 21.31 (SVL 26,33 mm) thu vào tháng 6/21 và ba cá thể cái trưởng thành TYT 211.7 (SVL 56,85mm), TYT 211.13 (SVL 53,88 mm), TYT 211.21 (SVL 45,54 mm). Đầu dài hơn rộng (HL 8,56-19,72 mm, HW 7,7-16,77 mm), mõm dài hơn đường kính mắt (SL 4,37-8,76 mm, ED 3,15-6,3 mm); màng nhĩ rõ, gần bằng 3/4 đường kính mắt (TD 2,35-4,8 mm, ED 3,15-6,3 mm); khoảng cách gian mũi hẹp hơn so với khoảng cách gian ổ mắt nhưng rộng hơn so với mí mắt trên (IND 1,82-4,79 mm); có răng lá mía. Ngón tay không có màng, mút ngón không có đĩa; chân sau dài và mảnh, chân có màng bơi gần như hoàn; gờ da lưng-sườn nhỏ kéo dài từ mắt đến háng. Lưng có màu nâu đỏ hay vàng nhạt, đôi khi xám nhạt; có một vệt hình thoi màu đen phủ hết màng nhĩ; gờ da trên màng nhĩ rõ; trên lưng có một nếp da mảnh hình chữ V ngược ở khoảng giữa hai vai; trên đùi và cẳng chân có những vệt xiên chéo; bụng trắng, ngực và ức có đốm xám', NULL, 'Nó được tìm thấy ở Campuchia , Trung Quốc , Hồng Kông , Lào , Malaysia , Myanma , Thái Lan và Việt Nam ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=4&loai=1&ID=5652'),
(3248, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Hylarana', NULL, 'GEN_0924', 'hylaranamaosonensis', 'Hylarana maosonensis', '(Bourret, 1937)            ', 'Chàng mẫu sơn', 'SPA_03265', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3249, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Hylarana', NULL, 'GEN_0924', 'hylaranamenglaensis', 'Hylarana menglaensis', 'Fei, Ye & Xie, 2008', 'Ếch suối mường la', 'SPA_03266', 'Chúng sống sống ở các vực suối chảy chậm và ở độ cao 1000-1600m so với mực nước biển. Cá thể cái của loài có kích thước 44,1 – 49,3 mm lớn hơn cá thể đực 38,9 – 44,9 mm, mặt trên của đầu và thân màu nâu xám với nhiều đốm đen nhỏ, hai bên sườn có các đốm đen lớn hơn. Tiếng kêu của loài được ghi nhận vào cả ngày và đêm.', NULL, ' đây là loài của Việt Nam và Trung Quốc (có thể cả ở Lào và Myanmar), trước đây chỉ được ghi nhận tại tỉnh Vân Nam, phía Tây Nam Trung Quốc.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Hylarana_menglaensis'),
(3250, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Hylarana', NULL, 'GEN_0924', 'hylaranamilleti', 'Hylarana milleti', '(Smith, 1921)', 'Chàng milê', 'SPA_03267', 'Cơ thể có kích thước trung bình. Răng lá mía xếp xiên, cách xa nhau, không chạm lỗ mũi trong; lưỡi dài, xẻ thuỳ ở phía sau. Đầu dài hơn rộng; mõm nhọn, gờ mõm rõ, vùng má lõm; mép miệng kéo dài đến 1/2 màng nhĩ. Lỗ mũi gần mút mõm hơn mắt. Màng nhĩ rõ ràng, nằm gần mắt; đường kính màng nhĩ bằng khoảng 3/4 hoặc bằng đường kính mắt. Mắt lớn, gian ổ mắt rộng hơn chiều rộng mí mắt trên một chút. Ngón tay tự do, ngón I dài hơn ngón II, gần bằng ngón IV, ngón III dài nhất; mút ngón tay và ngón chân phình thành đĩa; ngón chân có 3/4 màng. Củ bàn trong hình bầu dục, củ bàn ngoài tròn. Khớp chày - cổ đạt đến trước mắt, khớp cổ - bàn đạt hay vượt quá mõm một chút.\n\nDa sần nổi những hạt nhỏ, hai nếp da bên lưng rất rõ bắt đầu từ mép sau phía trên của mắt. Vùng má nâu sẫm, có vệt sẫm từ sau mắt, đôi khi qua màng nhĩ và mờ dần về phía sau. Mép màu trắng kéo dài và kết thúc bằng một đốm trắng trên vai. Trên lưng thường có các đốm sẫm nhỏ. Trên đùi, cổ, ống chân và bàn chân có các vệt sẫm màu vắt ngang. Mặt bụng màu trắng sáng. Kiếm ăn ban đêm, xuất hiện ở các khu vực rừng thường xanh núi cao dến 1000m. Thức ăn là các loài côn trùng sống trong khu vực sinh sống. Đẻ trứng vào tháng mùa mưa hằng năm ở các con suối và nòng nọc phát triển ở đó.', NULL, ' Quảng Bình, Thừa Thiên-Huế - Vườn quốc gia Bạch Mã, Kontum, Gia Lai, Đắk Lắk, Lâm Đồng – Vườn quốc gia Bidoup – Núi Bà, Khánh Hòa – Khu bảo tồn thiên nhiên Hòn Bà.\n\n  ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3251, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Hylarana', NULL, 'GEN_0924', 'hylarananigrovittata', 'Hylarana nigrovitata', '(Blyth, 1856)', 'Ếch suối', 'SPA_03268', 'Loài lưỡng cư có kích thước trung bình 60 - 75mm lưng màu ô liu với nhiều đốm sẫm Sọc sẫm từ mõm đến mắt. Màng nhĩ đen, vùng sau màng nhĩ tối kéo dài đến háng như một vệt sẫm dọc bờ ngoài của nếp bên lưng. Nếp da bên lưng to và rõ kéo dài từ mắt đến gần đùi, không chạm vào màng nhĩ. Màng nhĩ rất  to và rõ, đường kính khoảng 5/8 ổ mắt. Ngón tay trung bình, đầu ngón tay có đĩa nhỏ. 4/5 ngón chân có màng bơi. Củ dưới khớp tay, chân đều phát triển. Loài này thường sống trên các vùng núi ở nhiều độ cao khác nhau và lên đến trên 300m. Thường sống trong các hang, hốc nhỏ ven suối và các khe đá nhỏ có ít nước và ít thác ghềnh. Thức ăn của loài này là các loài côn trùng nhỏ, các loài ốc nhỏ. Trong quần thể nòng nọc nhận thấy số cá thể đực nhiều hơn số cá thể cái rất nhiều.', NULL, ' phân bố rộng từ Lạng Sơn, Ninh Bình, Hà Nội (Ba Vì), Huế, Kontum, Gia Lai và ở Đồng Nai, Bà Rịa - Vũng Tàu (Núi Dinh).  Lào, Thái Lan, Cambodia, Indonesia…', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3252, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Hylarana', NULL, 'GEN_0924', 'hylaranataipehensis', 'Hylarana taipehensis', '(Van Denburgh, 1909)           ', 'Chàng đài bắc', 'SPA_03269', 'Mẫu vật nghiên cứu: Ba cá đực thể trưởng thành TYT 2011.17 (SVL 27,27 mm), TYT 2011.18 (SVL 28,56 mm), TYT 2011.19 (SVL 25,14 mm) và một cá thể cái trưởng thành TYT 2011.16 (SVL 38,71 mm) Đầu dài hơn rộng (HL 10,19-14,42 mm, HW 7,80-10,15 mm); khoảng cách gian mắt rộng hơn mí mắt trên (IOD 3,45-5,17 mm, UEW 2,32-3,56 mm), màng nhĩ rất rõ, bằng khoảng 2/3 đường kính mắt (TD 2,13-2,80 mm, ED 2,83-3,47 mm); răng lá mía thành hai dãy xiên.\n\nCác ngón tay mảnh, mút ngón phình thành đĩa nhỏ; chân khoảng 3/4 có màng bơi; có hai củ bàn chân nhỏ; khi gập dọc thân khớp chày-cổ chạm tới mũi. Da mặt trên đầu và thân nhẵn, mặt bụng nhẵn; gờ da lưng-sườn rõ. Trên lưng màu xanh lá cây, rất hiếm khi có màu nâu nhạt; gờ lưng sườn màu trắng hoặc vàng nhạt; đôi khi có một vệt màu vàng nhạt ở giữa lưng, từ khoảng giữa lưng về phía hậu môn; mặt trên đùi có những vệt ngang, màu nâu sẫm; mặt bụng trắng hay vàng nhạt; con ngươi màu vàng kim. Loài này thường sống ở các ao hồ, đầm ở khu vực ngập nước tĩnh, nơi có nhiều thực vật thuỷ sinh và chúng thường ngồi trên các loài thực vật này kiếm ăn. Đôi khi gặp chúng sống trên cạn, gần mép nước.Thức ăn của loài này là các loài côn trùng nhỏ sống gần mặt nước.', NULL, 'Đây là loài có vùng phân bố rộng từ Hà Giang, Yên Bái, Tuyên Quang, Lạng Sơn, Vĩnh Phúc, Phú Thọ, Hoà Bình, Thanh Hoá, Gia Lai, Kontum, Đắc Lắc, Lâm Đồng và Kiên Giang. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3253, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Nidirana', NULL, 'GEN_1322', 'nidiranachapaensis', 'Nidirana chapaensis', '(Bourret, 1937)', 'Chàng sapa', 'SPA_03270', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3254, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Nidirana', NULL, 'GEN_1322', 'nidiranalini', 'Nidirana lini', '(Chou, 1999)', 'Chàng núi lin', 'SPA_03271', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3255, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Odorrana', NULL, 'GEN_1362', 'odorranaandersonii', 'Odorrana andersonii', '(Boulenger, 1882)            ', 'Chàng an đéc sơn', 'SPA_03272', 'Loài ếch khá lớn, dài thân 100 - 110 mm, lưng thường có mầu xanh hay nâu hoặc phía trước xanh và hơi nâu về phía sau. Ở con đực phía sau lưng, hai bên sườn đôi khi cả trên mí mắt có những hạt nhỏ, những hạt này có cả ở vùng lỗ huyệt, ở rìa phía ngoài háng và mặt trên phía ngoài cẳng chân. ở con cái những hạt này không rõ lắm nên da chúng không ráp nhiều như ở con đực. Trên các chi đều có các vệt ngang mầu tối. Phía dưới bụng và đùi đôi khi đỏ hồng nhưng thường vàng xanh. ức thường nâu đôi khi điểm chấm sẫm. Xung quanh con ngươi mắt có một vòng tròn khá rộng màu vàng. Con đực nhỏ hơn con cái nhiều. Thường sống bên bờ những con suối có nước chảy mạnh, có nhiều đá trên núi cao (600 - 1200m). Khác với nhiều loài ếch nhái khác đôi khi chúng đi kiếm ăn cả ban ngày. Thức ăn của chúng thường là: châu chấu, gián rừng, cuốn chiếu... Loài ếch này bơi giỏi, có thể bơi ngược dòng suối chảy xiết. Tuy thích sống trong môi trường nước nhưng nhiều khi chúng nấp trong các bụi cây, hốc đá bên bờ suối để kiếm mồi.', NULL, 'Trong nước: Lào Cai (Sapa, Ngòi Toi), Lạng Sơn (Hữu Liên), Quảng Ninh (Pò Hèn), Vĩnh Phúc (Tam Đảo), Hoà Bình (Tu Lý, Piềng Vế), Hà Tĩnh (Hương Sơn), Thừa Thiên - Huế (Lộc Hải), Kontum (Ngọc Linh), Gia Lai (Đắk Đoa, Sơklang), Đắk Lắk (Đạo Nghĩa, Krông Pách), Lâm Đồng (Đà Lạt, Killplagnol). Thế giới: Mianma, Trung Quốc, Lào, Thái Lan.', NULL, NULL, 'Được sử dụng như một nguồn thực phẩm của nhân dân vùng núi, ngoài ra còn có giá trị thẩm mỹ và khoa học.', 'VU', NULL, NULL, 'VnCreature'),
(3256, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Odorrana', NULL, 'GEN_1362', 'odorranabacboensis', 'Odorrana bacboensis', '(Bain, Lathrop, Murphy, Orlov & Ho, 2003)', 'Ếch bắc bộ', 'SPA_03273', 'Mẫu vật nghiên cứu: Hai cá thể cái TYT 21.15 (SVL 71,5 mm), TYT 21.14 (SVL 13,85 mm), một cá thể đực TYT 21.18 (SVL 66,81 mm) và một cá thể cái TYT 211.4 (SVL 49,87 mm). Đầu dài hơn rộng (HL 19,37-38,49 mm, HW 16,42-35,25 mm). Mõm ngắn (SL 8,27-14,82 mm); mắt to và lồi; mí mắt trên hẹp hơn khoảng cách gian mắt (UEW 3,54-9,58 mm, IOD 5,53-13,98 mm); đỉnh đầu phẳng, gờ mõm tròn, vùng má lõm; khoảng cách gian mũi bằng khoảng 3/4 chiều dài mõm (IND 5,17-11,77 mm); gờ da trên màng nhĩ khá rõ; màng nhĩ tròn, rõ (TD 3,85-6,52 mm); răng lá mía xiên; lưỡi xẻ đôi ở phía sau. Chi trước khoẻ, ngón ngắn, mảnh; mút ngón tay phình thành đĩa rộng, có rãnh ngang; củ dưới khớp hình nón; ngón chân dài có màng bơi hoàn toàn; mảnh, mút ngón có đĩa tròn có rãnh; củ dưới khớp lồi; củ bàn trong hình trứng, thuôn; không có củ bàn ngoài. Lưng, sườn và vùng má có màu nâu với những đốm đen; môi trên và dưới màu vàng kem với những sọc đen mảnh; mặt trên các chi và ngón màu nâu với những vệt ngang, màu đen; màng bơi màu trắng đục đến nâu sẫm; bụng màu kem đôi khi có những đốm sáng ở bụng, ngực và cằm; con ngươi vàng.', NULL, 'Việt Nam: Lào Cai, Tuyên Quang, Bắc Kạn, Nghệ An.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=6104'),
(3257, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Odorrana', NULL, 'GEN_1362', 'odorranabanaorum', 'Odorrana banaorum', '(Bain, Lathrop, Murphy, Orlov & Ho, 2003)', ' Ếch xanh bana', 'SPA_03274', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3258, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Odorrana', NULL, 'GEN_1362', 'odorranachapaensis', 'Odorrana chapaensis', '(Bourret, 1937)', 'Ếch bám đá sa pa', 'SPA_03275', 'Loài ếch có kích thước nhỏ, dài thân trung bình: 39mm, con đực thường nhỏ hơn con cái. Lưng  có mấu nâu đồng, có thể sâm hơn. Giữa lưng có một đường mấu trắng đục chạy từ phía sau ổ mắt tới tận hậu môn, càng sát hậu môn càng rõ nét hơn. Bên sườn sẫm, phía gần bụng màu trắng đục. Tay vàng xỉn có các vệt đen ngang mờ. Trên đùi và cẳng chân có những vệt đen ngang trên nền sáng. Mép dưới trắng bạc kéo đến tận vai, cằm màu sẫm. Nếp bên lưng rõ. Màng nhĩ rõ, thường màu sẫm. Chân dài, khớp cổ bàn vượt quá mõm, ngón có màng 1/3-1/2.', NULL, 'Lào Cai, Bắc Giang, Hà Tĩnh, Gia Lai.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=8&loai=1&ID=5651'),
(3259, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Odorrana', NULL, 'GEN_1362', 'odorranachloronota', 'Odorrana chloronota', '(Günther, 1876)            ', 'Ếch xanh', 'SPA_03276', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3260, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Odorrana', NULL, 'GEN_1362', 'odorranagrahami', 'Odorrana grahami', '(Boulenger, 1917)', 'Ếch gra ham', 'SPA_03277', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3261, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Odorrana', NULL, 'GEN_1362', 'odorranagraminea', 'Odorrana graminea', 'Boulenger, 1900', 'Ếch g-ra-mi-ne ', 'SPA_03278', 'có thân hình dẹp về phía lưng với đôi mắt to. Lưng có màu xanh, da mịn; hai bên sườn có màu nâu với các vân cẩm thạch màu vàng và có hạt nhẹ. Chúng là những loài ếch tương đối lớn, đặc biệt là ếch cái: ếch cái phát triển đến chiều dài mõm-lỗ thông 78–100 mm (3,1–3,9 in), trong khi ếch đực có chiều dài khiêm tốn hơn là 42–53 mm (1,7–2,1 in). Ngoài kích thước, con đực khác với con cái ở đĩa kỹ thuật số nhỏ hơn, cẳng tay khỏe hơn, màng nhĩ lớn hơn , miếng đệm mềm như nhung trên ngón tay cái và túi hình đôi bên dưới khớp hàm', NULL, 'vùng núi cao phía Nam Trung Quốc và Bắc Đông Dương.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3262, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Odorrana', NULL, 'GEN_1362', 'odorranalivida', 'Odorrana livida', '(Blyth, 1856)            ', 'Ếch xanh', 'SPA_03279', 'Con cái trưởng thành có chiều dài từ mõm đến lỗ thông là 89–97 mm (3,5–3,8 in) ( neotype và một mẫu vật được tham chiếu); con đực có lẽ nhỏ hơn nhiều. Cơ thể bị nén theo hướng lưng bụng. Đầu rộng và mõm tròn. Tympanum tròn và rõ ràng ; nếp gấp trên màng nhĩ yếu. Các ngón tay và ngón chân có đĩa đệm phát triển tốt; các ngón chân có màng đầy đủ. Mẫu vật được bảo quản có mặt lưng màu nâu đồng đều ; các chi màu nâu nhạt, không có sọc ngang', NULL, 'Nó chỉ được biết đến một cách chắc chắn từ địa phương kiểu mới của nó ở dãy Dawna ở Myanmar, gần biên giới với Thái Lan, [1] [2] nhưng dữ liệu phân tử cho thấy rằng nó hiện diện ở đông bắc Ấn Độ và cả bán đảo Thái Lan, trong khi hồ sơ từ Trung Quốc đề cập đến các loài khác', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Odorrana_livida'),
(3263, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Odorrana', NULL, 'GEN_1362', 'odorranamontivaga', 'Odorrana montivaga', 'Smith, 1921', '  ', 'SPA_03280', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3264, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Odorrana', NULL, 'GEN_1362', 'odorranamorafkai', 'Odorrana morafkai', '(Bain, Lathrop, Murphy, Orlov&Ho, 2003)', 'Ếch mô-rap-ka', 'SPA_03281', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3265, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Odorrana', NULL, 'GEN_1362', 'odorrananasica', 'Odorrana nasica', '(Boulenger, 1903)            ', 'Ếch gai mõm dài', 'SPA_03282', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3266, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Odorrana', NULL, 'GEN_1362', 'odorranaspp', 'Odorrana spp', NULL, 'Ếch sp ', 'SPA_03283', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3267, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Odorrana', NULL, 'GEN_1362', 'odorranatiannanensis', 'Odorrana tiannanensis', '(Yang & Li, 1980)', 'Ếch ti-an-nan ', 'SPA_03284', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3268, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Odorrana', NULL, 'GEN_1362', 'odorranatrankieni', 'Odorrana trankieni', '(Orlov, Le, and Ho, 2003)', 'Ếch trần kiên', 'SPA_03285', 'Rana trankieni đã được mô tả gần đây (Orlov và cộng sự, 2003) và là một loài ếch bậc thang khác ở Việt Nam (tên này chỉ mang tính sinh thái chứ không mang tính thông tin về phát sinh loài). R. trankieni được phân biệt bởi sự kết hợp các đặc điểm sau: đầu dài và rộng với mõm hẹp nhô ra; đầu hơi lõm giữa hai hốc mắt; lỗ mũi có khoảng cách bằng một nửa khoảng cách từ đầu mõm tới đầu trước của mắt. Nếp gấp trên màng nhĩ được phát triển tốt. Tympanum xấp xỉ 61% chiều dài mắt; tympanum cách mắt khoảng 2/3 đường kính tympanum. Độ dài tương đối của các ngón tay là III=I>II>IV. Chiều dài ngón chân tương đối là IV>V>III>II>I. Các ngón chân có màng cao, màng phủ đến mép gần của đĩa ngón chân và đầu xa của đốt ngón chân cuối.', NULL, 'Chỉ được biết đến ở địa phương điển hình ở thôn Mường Đỏ, huyện Phú Yên, tỉnh Sơn La, Việt Nam. Môi trường sống là một dòng suối rừng nhỏ với nước trong vắt xuyên qua khu rừng thứ sinh. Hai con ếch được thu thập trên bờ đá nơi có dòng suối chảy từ thác nước cao 10 m đến một rãnh rộng 25 m2 và sâu 1,2 m, hạ lưu có chiều rộng 2 m và độ sâu 20-40 cm.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://amphibiaweb.org/species/6206'),
(3269, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Paa', NULL, 'GEN_1418', 'paabourreti', 'Paa bourreti', '(Bourret 1937)', NULL, 'SPA_03289', 'Chiều dài thân trung bình 82mm (cá thể đực lớn nhất: 105mm, cá thể cái lớn nhất: 100mm). Đầu rộng mõm tù, nếp thái dương to chạy từ sau mắt đến gần chân trước. Màng nhĩ không rõ. Lưng màu xám hay xám nâu pha những vết vàng nhạt, con non có màu nâu đỏ. Trên lưng có những mụn cóc lớn hình hầu dục chạy gần thẳng hàng, trên mỗi mụn cóc có từ 2 - 3 đôi khi hơn những vai đen nhỏ. Giữa hai mụn cóc lớn có từ 1 - 5 mụn cóc nhỏ xếp xít nhau. Mặt trên các chi có nhiều vết xám to chạy ngang. Phần ngực, bụng và trên ngón I và II chân trước của con đực có nhiều gai nhỏ đen.\nSinh học, sinh thái:\nSống ở các suối chảy sâu trong rừng, tập trung ở đầu nguồn các con suối lớn, nơi có nhiều đá to, ít nước. Kiếm ăn ban đêm, thích ngâm mình trong nước rình mồi. Thức ăn gồm côn trùng cánh cứng, sâu non, ấu trùng chuồn chuồn, gián rừng, gọng cua. Tiếng kêu ban đêm rất lớn và âm vang. Ở một số nơi, đồng bào dân tộc gọi là ếch bò vì có tiếng kêu giống bò. Đẻ trứng từ tháng 8 đến tháng 11, ở suối nơi nước chảy chậm mỗi lần khoảng 200 - 300 trứng đường kinh 3,5 - 3,7mm. Nòng nọc phát triển trong nước.', NULL, 'Việt Nam: Lào Cai: Hà Giang. Tuyên Quang, Cao Bằng: Bắc Kạn, Vĩnh Phúc, Phú Thọ, Hòa Bình, Nghệ An, Thừa thiên Huế, Quảng Nam, Gia Lai, Kontum, Lâm Đồng.\nThế giới: Nam Trung Quốc, Lào.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=7&loai=1&ID=5649'),
(3270, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Paa', NULL, 'GEN_1418', 'paafansifani', 'Paa fansifani', NULL, 'Chàng Hoàng Liên Sơn', 'SPA_03290', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3271, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Paa', NULL, 'GEN_1418', 'paaverrucospinosa', 'Paa verrucospinosa', '(Bourret, 1937)', 'Ếch gai sần', 'SPA_03291', 'Chiều dài thân trung bình 82mm (cá thể đực lớn nhất: 105mm, cá thể cái lớn nhất: 100mm). Đầu rộng mõm tù, nếp thái dương to chạy từ sau mắt đến gần chân trước. Màng nhĩ không rõ. Lưng màu xám hay xám nâu pha những vết vàng nhạt, con non có màu nâu đỏ. Trên lưng có những mụn cóc lớn hình hầu dục chạy gần thẳng hàng, trên mỗi mụn cóc có từ 2 - 3 đôi khi hơn những vai đen nhỏ. Giữa hai mụn cóc lớn có từ 1 - 5 mụn cóc nhỏ xếp xít nhau. Mặt trên các chi có nhiều vết xám to chạy ngang. Phần ngực, bụng và trên ngón I và II chân trước của con đực có nhiều gai nhỏ đen. Sống ở các suối chảy sâu trong rừng, tập trung ở đầu nguồn các con suối lớn, nơi có nhiều đá to, ít nước. Kiếm ăn ban đêm, thích ngâm mình trong nước rình mồi. Thức ăn gồm côn trùng cánh cứng, sâu non, ấu trùng chuồn chuồn, gián rừng, gọng cua. Tiếng kêu ban đêm rất lớn và âm vang. Ở một số nơi, đồng bào dân tộc gọi là ếch bò vì có tiếng kêu giống bò. Đẻ trứng từ tháng 8 đến tháng 11, ở suối nơi nước chảy chậm mỗi lần khoảng 200 - 300 trứng đường kinh 3,5 - 3,7mm. Nòng nọc phát triển trong nước.', NULL, 'Việt Nam: Lào Cai: Hà Giang. Tuyên Quang, Cao Bằng: Bắc Kạn, Vĩnh Phúc, Phú Thọ, Hòa Bình, Nghệ An, Thừa thiên Huế, Quảng Nam, Gia Lai, Kontum, Lâm Đồng. Thế giới: Nam Trung Quốc, Lào.', NULL, NULL, NULL, NULL, NULL, NULL, 'Vncreature'),
(3272, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Paa', NULL, 'GEN_1418', 'paayunnanensis', 'Paa yunnanensis', '(Anderson, 1878)', 'Ếch gai vân nam', 'SPA_03292', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3273, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Papurana', NULL, 'GEN_1439', 'papuranaattigua', 'Papurana attigua', '(Inger, Orlov [fr], and Darevsky, 1999)', '  ', 'SPA_03293', 'Con đực trưởng thành có kích thước 40–45 mm (1,6–1,8 in) và con cái trưởng thành có chiều dài mõm-lỗ thông là 55–65 mm (2,2–2,6 in). Nhìn tổng thể có vẻ chắc nịch vừa phải. Đầu dài hơn chiều rộng và mõm nhọn, nhưng tròn và nhô ra khi nhìn từ bên. Tympanum rất khác biệt, ở nam giới tương đối lớn hơn ở nữ giới . Đầu ngón tay có hình đĩa nhỏ. Đĩa ngón chân cũng nhỏ nhưng có thể lớn hơn đĩa ngón tay một chút. Các ngón chân có màng một phần. Có các nếp gấp liên tục ở mặt lưng. Da có dạng hạt ở mặt lưng với các nốt sần nhỏ, có các nốt sần lớn hơn ở hai bên. Ở nhiều cá thể, cả con đực và con cái, củ có đầu nhọn, màu trắng. Màu lưng có màu nâu trung bình và có thể bao gồm các đốm nhỏ sẫm màu hơn. Một dải hẹp màu nâu sẫm đến đen chạy từ mõm qua mắt và màng nhĩ, trở nên mờ hơn ở vùng thái dương. Môi trên có sọc trắng đến vàng. Các chi có các thanh ngang màu nâu sẫm', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3274, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Pelophylax', NULL, 'GEN_1496', 'pelophylaxlateralis', 'Pelophylax lateralis', '(Boulenger, 1887)', 'Ếch bên', 'SPA_03294', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3275, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Phrynoglossus', NULL, 'GEN_1542', 'phrynoglossuslaevis', 'Phrynoglossus laevis', '(Günther, 1858)', 'Cóc nước nhẵn', 'SPA_03295', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3276, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Phynoglossus', NULL, 'GEN_1551', 'phynoglossuslaevis', 'Phynoglossus laevis', '(Günther, 1858)', 'Cóc nước nhẵn', 'SPA_03296', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3277, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'ranaalticola', 'Rana alticola', '(Boulenger, 1882)', 'Chàng núi cao', 'SPA_03297', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3278, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'ranaandersoni', 'Rana andersoni', 'Boulenger', 'Chàng Anđecsơn', 'SPA_03298', 'Loài ếch khá lớn, dài thân 100 - 110 mm, lưng thường có mầu xanh hay nâu hoặc phía trước xanh và hơi nâu về phía sau. Ở con đực phía sau lưng, hai bên sườn đôi khi cả trên mí mắt có những hạt nhỏ, những hạt này có cả ở vùng lỗ huyệt, ở rìa phía ngoài háng và mặt trên phía ngoài cẳng chân. ở con cái những hạt này không rõ lắm nên da chúng không ráp nhiều như ở con đực. Trên các chi đều có các vệt ngang mầu tối. Phía dưới bụng và đùi đôi khi đỏ hồng nhưng thường vàng xanh. ức thường nâu đôi khi điểm chấm sẫm. Xung quanh con ngươi mắt có một vòng tròn khá rộng màu vàng. Con đực nhỏ hơn con cái nhiều. Thường sống bên bờ những con suối có nước chảy mạnh, có nhiều đá trên núi cao (600 - 1200m). Khác với nhiều loài ếch nhái khác đôi khi chúng đi kiếm ăn cả ban ngày. Thức ăn của chúng thường là: châu chấu, gián rừng, cuốn chiếu... Loài ếch này bơi giỏi, có thể bơi ngược dòng suối chảy xiết. Tuy thích sống trong môi trường nước nhưng nhiều khi chúng nấp trong các bụi cây, hốc đá bên bờ suối để kiếm mồi.', NULL, ' Lào Cai (Sapa, Ngòi Toi), Lạng Sơn (Hữu Liên), Quảng Ninh (Pò Hèn), Vĩnh Phúc (Tam Đảo), Hoà Bình (Tu Lý, Piềng Vế), Hà Tĩnh (Hương Sơn), Thừa Thiên - Huế (Lộc Hải), Kontum (Ngọc Linh), Gia Lai (Đắk Đoa, Sơklang), Đắk Lắk (Đạo Nghĩa, Krông Pách), Lâm Đồng (Đà Lạt, Killplagnol).  Mianma, Trung Quốc, Lào, Thái Lan.', NULL, NULL, 'Được sử dụng như một nguồn thực phẩm của nhân dân vùng núi, ngoài ra còn có giá trị thẩm mỹ và khoa học.', 'VU', NULL, NULL, 'vncreatures'),
(3279, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'ranabanaorum', 'Rana banaorum', 'Bain, Lathrop, Murphy, Orlov And Ho, 2003', NULL, 'SPA_03299', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3280, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'ranachapaensis', 'Rana chapaensis', 'Bourret, 1937.', 'Chàng Sapa', 'SPA_03300', 'Loài ếch có kích thước nhỏ, dài thân trung bình: 39mm, con đực thường nhỏ hơn con cái. Lưng  có mấu nâu đồng, có thể sâm hơn. Giữa lưng có một đường mấu trắng đục chạy từ phía sau ổ mắt tới tận hậu môn, càng sát hậu môn càng rõ nét hơn. Bên sườn sẫm, phía gần bụng màu trắng đục. Tay vàng xỉn có các vệt đen ngang mờ. Trên đùi và cẳng chân có những vệt đen ngang trên nền sáng. Mép dưới trắng bạc kéo đến tận vai, cằm màu sẫm. Nếp bên lưng rõ. Màng nhĩ rõ, thường màu sẫm. Chân dài, khớp cổ bàn vượt quá mõm, ngón có màng 1/3-1/2.Ven các suối và các vũng nước ở độ cao trên 600m nơi có nhiều cây bụi rậm rạp. Lòng suối thường là đất xen lẫn đá, bờ suối thoải, có những khoảng trống nhất định. Hoạt động kiếm ăn về ban đêm. Các loại côn trùng nhỏ. Từ tháng 4 đến tháng 7 hàng năm. Trứng màu vàng chanh, đẻ thành tổ (khoảng 20-30 trứng/tổ) trong những vũng nước đọng nhỏ sát mép suối, phần lớn thể tích trứng chìm trong nước. Khi nở nòng nọc nhỏ và thường hoạt động ở các vũng nước đọng', NULL, 'Lào Cai, Bắc Giang, Hà Tĩnh, Gia Lai.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5651'),
(3281, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'ranachloronota', 'Rana chloronota', '(Gunther, 1875)', NULL, 'SPA_03301', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3282, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'ranadoriae', 'Rana doriae', '(Boulenger, 1887)', 'Ếch Dori', 'SPA_03302', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3283, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'ranaerythraea', 'Rana erythraea', '(Schlegel, 1873)', 'Chàng xanh', 'SPA_03303', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3284, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'ranaguentheri', 'Rana guentheri', '(Boulenger, 1882)', 'Chẫu', 'SPA_03304', 'Đầu dài hơn rộng (HL 16,93-26,75 mm, HW 12,48-20,11 mm); mõm nhọn, nhô về phía trước so với hàm dưới; gờ mõm rõ, vùng má lõm và xiên; khoảng cách gian mũi lớn hơn chiều rộng mí mắt trên và gần bằng đường kính màng nhĩ (IND 4,74-7,38 mm, UEW 3,16-5,2 mm, TD 4,9-7,17 mm); gờ da trên màng nhĩ rõ; có răng lá mía chạm bờ trước của lỗ mũi trong. Ngón chân có màng bơi gần như hoàn toàn trừ ngón IV; mút ngón chân hơi phình rộng, không có củ bàn ngoài; khi gập dọc thân, khớp cổ-bàn chạm góc trước của mắt; có nếp da lưng-sườn kéo dài từ sau mắt tới gốc đùi; có gờ da nhỏ từ góc sau mép đến vai.Da nhẵn, lưng xám nâu hay nâu đỏ, đồng màu, đôi khi có các vết nâu sẫm; màng nhĩ màu nâu sẫm hay nâu đỏ với viền sáng xung quanh; bụng màu trắng đục, cằm và dưới chân màu trắng hơi vàng; phần sau mặt dưới đùi có các nốt sần nhỏ. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Hệ thống thông tin, cơ sở dữ liệu môi trường tỉnh Bắc Kạn'),
(3285, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'ranajohnsi', 'Rana johnsi', 'Smith, 1921            ', 'Chàng hiu', 'SPA_03305', ' Đầu dài hơn rộng (HL 8,56-19,72 mm, HW 7,7-16,77 mm), mõm dài hơn đường kính mắt (SL 4,37-8,76 mm, ED 3,15-6,3 mm); màng nhĩ rõ, gần bằng 3/4 đường kính mắt (TD 2,35-4,08 mm, ED 3,15-6,3 mm); khoảng cách gian mũi hẹp hơn so với khoảng cách gian ổ mắt nhưng rộng hơn so với mí mắt trên (IND 1,82-4,79 mm); có răng lá mía. Ngón tay không có màng, mút ngón không có đĩa; chân sau dài và mảnh, chân có màng bơi gần như hoàn; gờ da lưng-sườn nhỏ kéo dài từ mắt đến háng. Lưng có màu nâu đỏ hay vàng nhạt, đôi khi xám nhạt; có một vệt hình thoi màu đen phủ hết màng nhĩ; gờ da trên màng nhĩ rõ; trên lưng có một nếp da mảnh hình chữ V ngược ở khoảng giữa hai vai; trên đùi và cẳng chân có những vệt xiên chéo; bụng trắng, ngực và ức có đốm xám. Thường gặp ở những vùng rừng núi, ở những độ cao khác nhau thường là những nơi đất ẩm ướt (thung lũng, rừng cây gỗ. khe núi, rãnh nước gần rừng...).Thức ăn gồm mối. châu chấu, dế con, cánh cứng, kiến vàng nhỏ, kiến đen, sâu non và cả rết. Mùa sinh sản từ tháng 9 đến tháng 1, đẻ trứng vào những vũng nước.', NULL, 'Loài phổ biến và thường gặp ở miền Bắc, Bắc trung bộ, khu vực Tây Nguyên và miền Nam. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
