(3288, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'ranalateralis', 'Rana lateralis', 'Boulenger, 1887', 'Êch bên', 'SPA_03308', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3289, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'ranalimnocharis', 'Rana limnocharis', 'Gravenhorst.', 'Ngóe', 'SPA_03309', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3290, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'ranalivida', 'Rana livida', '(Blyth, 1856)', 'ếch xanh', 'SPA_03310', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3291, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'ranamacrodactyla', 'Rana macrodactyla', '(Guther, 1859)', 'Chàng hiu', 'SPA_03311', '. Miệng dài và nhọn, thân hình mảnh mai, bàn chân dài và thon. Mặt sau màu xanh lục hoặc nâu, có đốm đen, có 4-5 đường dọc và ngang màu nhạt, một đường ở giữa lưng và hai đường ở mỗi bên của lưng có nếp gấp. Các chi có sọc màu nâu sẫm, mặt bụng hơi vàng, mặt bụng màu trắng.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.'),
(3292, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'ranamaosonensis', 'Rana maosonensis', '(Bourret 1937)', 'Chàng Mẫu Sơn', 'SPA_03312', 'Mẫu vật nghiên cứu: Một cá thể đực trưởng thành TYT 2010.19 (SVL 40,70 mm) thu vào tháng 6/2010; hai cá thể đực trưởng thành TYT 2011.15 (SVL 41,57 mm), TYT 2011.20 (SVL 45,1 mm) thu vào tháng 11/2011; một cá thể đực TYT 2012.26 (SVL 42,14 mm), một cá thể cái TYT 2012.27 (SVL 58,75 mm). Đầu dài hơn rộng (HL 14,83-22,11 mm, HW 13,96-21,12 mm); mõm tròn, ngắn hơn so với đường kính mắt (SL 5,7-7,34 mm, ED 6,42-7,91 mm); khoảng cách gian mắt hẹp hơn khoảng cách gian mũi và chiều rộng mí mắt trên (IND 4,18-6,05 mm, IOD 3,97-5,93 mm, UEW 4,29-6,2 mm ); đường kính màng nhĩ bằng một nửa đường kính mắt (TD 3,54-4,46 mm); có răng lá mía, lưỡi chẻ đôi ở phía sau, không co túi kêu.Ngón tay mảnh, không có màng bơi, mút ngón tay phình thành đĩa nhỏ với các đĩa nhỏ; ngón chân khoảng 3/4 có màng bơi; khi gập dọc thân khớp chày-cổ chạm tới giữa mắt và mút của mõm.\n\nLưng có nhiều nốt sần; gờ da lưng, sườn được tạo thành bởi một dãy các nốt sần; mặt trên đầu và lưng màu nâu với nhiều đốm sẫm màu không đều nhau; sườn màu xám nâu với các đốm đen; trên tay, đùi và cẳng chân có những vệt ngang màu đen. Mép trên có sọc màu trắng, kéo dài từ dưới ổ mắt đến phía sau màng nhĩ; màng nhĩ màu nâu đen. Các suối đá dưới tán rừng thường xanh còn tốt. Thức ăn được ghi nhận là các loại côn trùng nhỏ như kiến, mối, sâu bọ. Sinh sản vào mùa mưa và đã thấy ổ trứng ngay cạnh các vũng nước đọng ven suối thuộc Vườn quốc gia Tam Đảo', NULL, 'Việt Nam: Lào Cai, Hà Giang, Cao Bằng, Bắc Kạn, Tuyên Quang, Lạng Sơn, Sơn La, Vĩnh Phúc, Quảng Ninh, Bắc Giang, Hải Dương, Sơn La, Hòa Bình, Ninh Bình, Thanh Hóa, Nghệ An, Hà Tĩnh, Quảng Bình, Quảng Trị,  Thừa Thiên-Huế. Thế giới: Lào.', NULL, NULL, NULL, NULL, NULL, NULL, 'Vn Creature'),
(3293, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'ranamargaretae', 'Rana margaretae', 'Liu, 1950. ', NULL, 'SPA_03313', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3294, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'rananasica', 'Rana nasica', 'Boulenger', 'Chàng mũi', 'SPA_03314', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3295, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'rananigrovittata', 'Rana nigrovittata', '(Blyth, 1855)', 'Ếch Suối', 'SPA_03315', 'Loài lưỡng cư có kích thước trung bình 60 - 75mm lưng màu ô liu với nhiều đốm sẫm Sọc sẫm từ mõm đến mắt. Màng nhĩ đen, vùng sau màng nhĩ tối kéo dài đến háng như một vệt sẫm dọc bờ ngoài của nếp bên lưng. Nếp da bên lưng to và rõ kéo dài từ mắt đến gần đùi, không chạm vào màng nhĩ. Màng nhĩ rất  to và rõ, đường kính khoảng 5/8 ổ mắt. Ngón tay trung bình, đầu ngón tay có đĩa nhỏ. 4/5 ngón chân có màng bơi. Củ dưới khớp tay, chân đều phát triển Loài này thường sống trên các vùng núi ở nhiều độ cao khác nhau và lên đến trên 300m. Thường sống trong các hang, hốc nhỏ ven suối và các khe đá nhỏ có ít nước và ít thác ghềnh. Thức ăn của loài này là các loài côn trùng nhỏ, các loài ốc nhỏ. Trong quần thể nòng nọc nhận thấy số cá thể đực nhiều hơn số cá thể cái rất nhiều', NULL, 'đây là loài có vùng phân bố rộng từ Lạng Sơn, Ninh Bình, Hà Nội (Ba Vì), Huế, Kontum, Gia Lai và ở Đồng Nai, Bà Rịa - Vũng Tàu (Núi Dinh) Lào, Thái Lan, Cambodia, Indonesia..', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
