(3302, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'ranataipehensis', 'Rana taipehensis', '(Bourret, 1937)', 'Chàng Đài Bắc', 'SPA_03322', 'Mẫu vật nghiên cứu: Ba cá đực thể trưởng thành TYT 2011.17 (SVL 27,27 mm), TYT 2011.18 (SVL 28,56 mm), TYT 2011.19 (SVL 25,14 mm) và một cá thể cái trưởng thành TYT 2011.16 (SVL 38,71 mm) Đầu dài hơn rộng (HL 10,19-14,42 mm, HW 7,80-10,15 mm); khoảng cách gian mắt rộng hơn mí mắt trên (IOD 3,45-5,17 mm, UEW 2,32-3,56 mm), màng nhĩ rất rõ, bằng khoảng 2/3 đường kính mắt (TD 2,13-2,80 mm, ED 2,83-3,47 mm); răng lá mía thành hai dãy xiên.\n\nCác ngón tay mảnh, mút ngón phình thành đĩa nhỏ; chân khoảng 3/4 có màng bơi; có hai củ bàn chân nhỏ; khi gập dọc thân khớp chày-cổ chạm tới mũi. Da mặt trên đầu và thân nhẵn, mặt bụng nhẵn; gờ da lưng-sườn rõ. Trên lưng màu xanh lá cây, rất hiếm khi có màu nâu nhạt; gờ lưng sườn màu trắng hoặc vàng nhạt; đôi khi có một vệt màu vàng nhạt ở giữa lưng, từ khoảng giữa lưng về phía hậu môn; mặt trên đùi có những vệt ngang, màu nâu sẫm; mặt bụng trắng hay vàng nhạt; con ngươi màu vàng kim. Loài này thường sống ở các ao hồ, đầm ở khu vực ngập nước tĩnh, nơi có nhiều thực vật thuỷ sinh và chúng thường ngồi trên các loài thực vật này kiếm ăn. Đôi khi gặp chúng sống trên cạn, gần mép nước.Thức ăn của loài này là các loài côn trùng nhỏ sống gần mặt nước.', NULL, 'Đây là loài có vùng phân bố rộng từ Hà Giang, Yên Bái, Tuyên Quang, Lạng Sơn, Vĩnh Phúc, Phú Thọ, Hoà Bình, Thanh Hoá, Gia Lai, Kontum, Đắc Lắc, Lâm Đồng và Kiên Giang. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vn Creature'),
(3303, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Ranidae', 'Ếch Nhái', 'FAM_316', 'Rana', NULL, 'GEN_1711', 'ranaverrucospinosa', 'Rana verrucospinosa', 'Bourret.', 'Ếch gai sần', 'SPA_03323', ' Đặc điểm nhận dạng:\n\nChiều dài thân trung bình 82mm (cá thể đực lớn nhất: 105mm, cá thể cái lớn nhất: 100mm). Đầu rộng mõm tù, nếp thái dương to chạy từ sau mắt đến gần chân trước. Màng nhĩ không rõ. Lưng màu xám hay xám nâu pha những vết vàng nhạt, con non có màu nâu đỏ. Trên lưng có những mụn cóc lớn hình hầu dục chạy gần thẳng hàng, trên mỗi mụn cóc có từ 2 - 3 đôi khi hơn những vai đen nhỏ. Giữa hai mụn cóc lớn có từ 1 - 5 mụn cóc nhỏ xếp xít nhau. Mặt trên các chi có nhiều vết xám to chạy ngang. Phần ngực, bụng và trên ngón I và II chân trước của con đực có nhiều gai nhỏ đen.\n\nSinh học, sinh thái:\n\nSống ở các suối chảy sâu trong rừng, tập trung ở đầu nguồn các con suối lớn, nơi có nhiều đá to, ít nước. Kiếm ăn ban đêm, thích ngâm mình trong nước rình mồi. Thức ăn gồm côn trùng cánh cứng, sâu non, ấu trùng chuồn chuồn, gián rừng, gọng cua. Tiếng kêu ban đêm rất lớn và âm vang. Ở một số nơi, đồng bào dân tộc gọi là ếch bò vì có tiếng kêu giống bò. Đẻ trứng từ tháng 8 đến tháng 11, ở suối nơi nước chảy chậm mỗi lần khoảng 200 - 300 trứng đường kinh 3,5 - 3,7mm. Nòng nọc phát triển trong nước.\n\n', NULL, ' Việt Nam: Lào Cai: Hà Giang. Tuyên Quang, Cao Bằng: Bắc Kạn, Vĩnh Phúc, Phú Thọ, Hòa Bình, Nghệ An, Thừa thiên Huế, Quảng Nam, Gia Lai, Kontum, Lâm Đồng.\n\nThế giới: Nam Trung Quốc, Lào.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.'),
