(3315, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Feihyla', NULL, 'GEN_0712', 'feihylavittata', 'Feihyla vittata', '(Boulenger, 1887)', 'Nhái cây sọc', 'SPA_03335', 'Mẫu vật nghiên cứu: Hai cá thể đực TYT 2010.28 (SVL 23,96 mm), TYT  2010.51 (SVL 26,91 mm) và cá thể đực TYT 2011.3 (SVL 22,31 mm. Loài ếch nhỏ, đầu dài hơn rộng (HL 8,19 - 9,7 mm, HW 7,42-8,04 mm), mõm nhọn, chiều dài tương đương đường kính mắt (SL 3,4 - 4,27 mm, ED 2,78-3,49 mm); màng nhĩ không rõ (TD 0,95 - 1,66 mm); khoảng cách gian mắt rộng hơn so với mí mắt trên (IOD 2,04 - 2,9 mm, UEW 1,67 - 2,32 mm); không có răng lá mía; lưỡi chẻ đôi ở phía sau.', NULL, 'rong nước: Lạng Sơn, Bắc Giang, Hải Phòng, Phú Thọ, Vĩnh Phúc, Hòa Bình, Hà Tĩnh, Quảng Bình, Thừa Thiên - Huế, Kontum, Gia Lai, Đắk Lắk, Đồng Nai, Bà Rịa - Vũng Tàu, đến An Giang và Kiên Giang.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=46&loai=&ID=5660'),
(3316, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Gracixalus', NULL, 'GEN_0788', 'gracixalussupercornutus', 'Gracixalus supercornutus', 'Orlov, Ho, and Nguyen, 2004', 'Nhái cây xanh', 'SPA_03336', 'Chiều dài từ mút mõm đến lỗ huyệt 19 - 20 mm. Đầu dài hơn rộng. Dài đầu 7.4 mm. Rộng đầu 6.6 mm. Mõm nhọn, dài hơn đường kính ngang mắt. Dài mõm 2.7 mm. Đường kính mắt 2.1 mm. Khoé mắt hình tam giác. Vùng má lõm. Gian ổ mắt rộng hơn gian mũi và mí mắt trên. Gian ổ mắt 2.4 mm. Gian mũi 1.6 mm. Rộng mi mắt 1.1 mm. Mũi nằm ở hướng bên, gần mút mõm hơn mắt. Mũi mõm 0.9 mm. Mắt mõm 1.7 mm. Màng nhĩ hình bầu dục, nhở hơn khoảng cách mắt màng nhĩ. Đường kính màng nhĩ 1.7 mm. Khoảng cách mắt màng nhĩ 1.2 mm. Nếp trên màng nhĩ mờ. Răng lá mía tiêu biến. Lưỡi sâu chữ V về phía sau.Mặt lưng của đầu, thân và chân có nốt sần nhỏ. Có riềm da quanh lỗ huyệt và trên mí mắt có sừng gai. Da bụng của họng, ngực, bụng và đùi nổi hột. Màu sắc khi còn sống: Lưng màu xanh lá cây vàng, có đốm nâu kích thước khác nhau. Có một vệt màu nâu hình chữ T ở gian ổ mắt. Dưới mắt và màng nhĩ có vết trắng. mặt lưng của ngón chân trước và san có sọc đen. Mặt bụng màu trắng vàng, có nổi hột trắng.', NULL, 'Loài đặc hữu được phát hiện ở miền Trung Việt Nam ở Vườn quốc gia Bạch Mã cho đến Lâm Đồng ở Vườn quốc gia Bidoup - Núi Bà và VVườn quốc gia Ngọc Linh, Kontum.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=6026'),
(3317, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Kurixalus', NULL, 'GEN_1004', 'kurixalusbanaensis', 'Kurixalus banaensis', 'Bourret, 1939', 'Nhái cây Bà Nà', 'SPA_03337', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3318, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Kurixalus', NULL, 'GEN_1004', 'kurixalusbisacculus', 'Kurixalus bisacculus', '(Taylor, 1962)', 'Ếch cây sần tay-lo', 'SPA_03338', 'Con đực ở Thái Lan có chiều dài mõm-miệng là 29–36 mm (1,1–1,4 in) ; [5] con đực từ dãy núi Cardamon (Campuchia) có chiều dài mõm-mũi 27–31 mm (1,1–1,2 in). [6] Mẫu vật cái có chiều dài từ mõm đến lỗ thông là 29 mm (1,1 in). Lưng có màu nâu với một số vết sẫm màu hơn; phần bụng có màu trắng đến trắng vàng. Tympanum lớn . [2] Mũi nhọn ở đầu và kéo dài thành phần nhô ra trên da , đặc biệt là ở con cái. Tất cả các ngón tay đều có màng cơ bản. [4] Các ngón chân có tới 3/4 có màng. [2] Cằm, bụng và mặt dưới của xương đùi có dạng hạt. Mặt dưới của cánh tay và cổ chân có một hàng nốt sần, tiếp tục kéo dài đến các ngón bên ngoài', NULL, 'Nó được tìm thấy ở Đông Nam Á và miền nam Trung Quốc', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Kurixalus_bisacculus'),
