(3328, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Philautus', NULL, 'GEN_1533', 'philautusparvulus', 'Philautus parvulus', '(Boulenger, 1893)', 'Nhái cây', 'SPA_03348', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
