(3330, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Philautus', NULL, 'GEN_1533', 'philautussp', 'Philautus sp.', NULL, 'Nhái cây', 'SPA_03350', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3331, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Polypedates', NULL, 'GEN_1602', 'polypedatesdennysii', 'Polypedates dennysii', '(Blanford, 1881)', 'Êch cây xanh đốm', 'SPA_03351', 'Là một trong những loài ếch cây lớn nhất châu Á, con đực có chiều dài thân tới 128mm, con cái tới 134mm. Màu sắc có thể thay đổi từ xanh lá cây sẫm, xanh ngọc hay xanh dương. Nhiều khi trên lưng có những đốm trắng lớn, ở một vài cá thể có những đốm màu gỉ sắt, nhiều cá thể khác chỉ có một màu xanh tuyền. Bụng màu trắng, màng bơi rất rộng để thích nghi với điều kiện sống trên cây. Sống trong các khu rừng thường xanh ở độ cao từ 300m đến 1.200m, trên các cây cao, trên mặt đất, tảng đá phủ rêu, trên có ven các suối đá nhất là quanh các thác nước. Đôi khi gặp cả ở những khu vực đất hoang hay đất canh tác nhưng sát rừng và gần các suối lớn. Thức ăn là các loài côn trùng sống trong khu vực loài này phân bố. Mùa sinh sản từ tháng 3  đến tháng 6 (trong điều kiện nuôi chúng đẻ cả vào mùa thu). Khoảng 200-300 trứng được đẻ thành những ổ bọt lớn đường kính 18-20cm bám vào thân cây, các tảng đá, trên lá khô dưới tán rừng gần suối. Nòng nọc phát triển trong nước, ếch con chỉ có một màu xanh nhạt, những đốm sáng xuất hiện khi chiều dài đạt khoảng 40mm, những đốm màu gỉ sắt chỉ có ở những con đã trưởng thành.', NULL, 'Cao Bằng, Băc Kạn, Lạng Sơn, Vĩnh Phúc, Bắc Giang, Hải Dương, Ninh Bình, Quảng Bình. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vn Creature'),
(3332, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Polypedates', NULL, 'GEN_1602', 'polypedateskio', 'Polypedates kio (reiwardtii)', NULL, 'Êch cây xanh', 'SPA_03352', 'Là loài ếch cây khá lớn, dài thân con đực 58 - 79mm. Mặt trên lưng và đầu mầu xanh lá cây hay xanh dương với những đốm trắng. Bụng vàng tươi, có đốm đen lớn trên nền vàng ở hai bên nách. Bàn chân tay có màng hoàn toàn, đĩa ngón rộng trên nền vàng của màng chân (màng tay của 3 ngón ngoài) có mầu đen hay tím sẫm. Màng chân lớn, nếp da bên cánh tay rộng giúp ếch có thể liệng từ trên cây cao xuống. Gót chân có nếp da nhọn. Mầu sắc con đực và con cái giống nhau. Loài này gặp ở hầu khắp các rừng ở trung du và miền núi đến độ cao 1500m. Thức ăn của ếch cây kio là sâu non, cánh màng, kiến, đó là những con mồi có sẵn trên cây. Ếch cây kio sinh sản từ đầu tháng 4 cho đến hết tháng 8. Thời gian sinh sản tập trung vào tháng 4 - 5 (Buôn Lưới), tháng 7 - 8 (Bến En). Vào những đêm mưa, ếch tập trung quanh các hồ nước trên các cành cây, thường số lượng con đực gấp đôi con cái. Trời tối hẳn chúng liệng từ trên cây cao 3 - 5m xuống mặt hồ, ghép thành đôi, con cái cõng con đực leo lên các cành cây ven hồ và các con đực khác củng bám theo tạo thành một nhóm từ 5 - 7 con đực cùng giao phối với 1 con cái. Thời gian giao phối từ 1 - 4 giờ. Trứng được đẻ và thụ tinh luôn cuộn trong những chiếc lá tạo thành những ổ bọt dài 18 - 22cm treo lơ lửng cách đất 0,5 - 1m. Nòng nọc phát triển trong ổ bọt rồi rơi xuống nước.', NULL, 'Trong nước: Lào Cai (Sa Pa), Phú Thọ (Thanh Sơn, Vườn quốc gia Xuân Sơn), Thanh Hóa (Bến En), Hà Tĩnh (Hương Sơn), Quảng Bình (Phong Nha - Kẻ Bàng), Gia Lai (Buôn Lưới). Thế giới: Trung Quốc (Vân Nam, Quảng Tây), Lào, Thái Lan.', NULL, NULL, 'Có giá trị khoa học và thẩm mĩ. Có gía trị nghiên cứu khoa học về sinh thái và tập tính của loài.', 'EN', 'VU', NULL, NULL),
(3333, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Polypedates', NULL, 'GEN_1602', 'polypedatesleucomystax', 'Polypedates leucomystax', '(Gravenhorst, 1829)            ', 'Ếch cây mép trắng', 'SPA_03353', 'Miệng rộng, mắt lớn và lồi, vượt rõ bờ hàm khi nhìn từ trên xuống. Răng lá mía dài, không chạm lỗ mũi tromh, xếp hình chữ V nông, không chạm nhau. Gờ mõm rõ, vùng má hơi lõm. Mắt lớn và lồi. Lỗ mũi gần sát mõm. Màng nhĩ rõ, đường kính màng nhĩ bằng 2/3-3/4 đường kính mắt. Chi và các ngón khá dài, mút các ngón tay, chân có đĩa bám. Đĩa ngón tay lớn hơn đĩa ngón chân, bằng khoảng 4/5 đường kính màng nhĩ. Màng bơi giữa các ngón tay rất bé và ở ngón chân chiếm ¾ có màng. Cũ khớp dưới ngón rõ, củ bản trong rõ có hình bầu dục. Khớp chày - cổ đạt tới mõm. Bờ ngoài ống tay, bàn tay, ống chân, bàn chân nhẵn. Da trên lưng nhẵn, mặt bụng và dưới các chi có các nốt sần nhỏ.\nThân màu nâu nhạt, có khi vàng nhạt, hoa văn của loài này khá đa dạng phụ thuộc vào vùng phân bố. Dạng thứ nhất trên lưng có 4 vệt màu nâu sẫm, hai vệt ở giựa bắt đầu từ mút mõm và 2 vệt hai bên bắt đầu từ trên mí mắt và mờ dần về phía chân sau.. Hai bên thân có vệt màu đen từ sau mắt đến ½ thân. Dạng thứ hai có hoa văn hình chữ X từ trên lưng, hai vệt đen kéo dài từ sau mắt qua màng nhĩ đến ½ thân ở mỗi bên. Dạng thứ ba có thân màu vàng nhạt với các chấm nhỏ màu nâu ở mặt trên đầu, lưng. Bụng màu trắng đục và các chi sau có các vệt sẫm màu vắt ngang. Loài này sống trên cây trong các khu rừng thường xanh và các khu vực rừng phục hồi ở độ cao 10 đến 2000m. Ban ngày chúng ẩn trong các bụi cây, ban đêm chuyền ra kiếm ăn. Thức ăn là sâu non, cánh màng, kiến. Chúng di chuyển dễ dàng trên thân cây và cành lá cũng có thể nhảy từ cành nọ sang cành kia. Loài này sau khi được các nhà nghiên cứu Nhật Bản làm phân tích gen đã phát hiện ra là tên đồng danh của loài Rhacophorus mutus', NULL, 'phân bố ở Quảng Ninh, Bắc Bắc Giang, Lạng Sơn, Bắc Cạn, Hoà Bình, Hà Tây, Hà Tĩnh, Vĩnh Linh đến Kontum, Gia Lai, Đắc Lắc, Lâm Đồng, Đồng Nai ... phân bố khá rộng trong các nước thuộc khu vực Đông Nam á, Trung Quốc, Srilanka và Ấn Độ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vncreatures'),
(3334, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Polypedates', NULL, 'GEN_1602', 'polypedatesmegacephalus', 'Polypedates megacephalus', 'Hallowell, 1861.', 'Êch cây ', 'SPA_03354', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3335, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Polypedates', NULL, 'GEN_1602', 'polypedatesmutus', 'Polypedates mutus', '(Smith, 1940)            ', 'Ếch cây Mu tus', 'SPA_03355', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3336, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Polypedates', NULL, 'GEN_1602', 'polypedatessp1', 'Polypedates sp1.', NULL, 'Êch cây (vạch)', 'SPA_03356', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3337, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Raorchestes', NULL, 'GEN_1713', 'raorchestesparvulus', 'Raorchestes parvulus', '(Boulenger, 1893)', 'Nhái cây tí hon', 'SPA_03357', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3338, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorusannamensis', 'Rhacophorus annamensis', 'Smith, 1924            ', 'Ếch cây trung bộ', 'SPA_03358', 'Loài ếch cỡ lớn, dài thân con đực 72mm, con cái 87mm (có cá thể tới 110mm). Màu của thân thường là nâu nhạt, nâu sẫm bay xám nhạt. Trên thân nhiều khi có các chấm đen và những vết màu vàng, nâu, đỏ hay xanh. Loài ếch này có màu sắc thay đổi giữa ban ngày và ban đêm. Vào mùa sinh sản các vết đen, vàng, đỏ trở nên đặc biệt tương phản. Mặt trên thân sẽ có màu rất sặc sỡ; bụng có màu vàng, hồng hay trong. Chân, tay có màng hoàn toàn và đĩa bám lớn giúp con vật có thể liệng một khoảng cách xa đến 1m. Ếch con có màu khác hẳn ếch bố mẹ, rời nước lên cạn chúng có màu ghi nhạt hay trắng hoàn toàn với nhiều đốm đen to trên toàn. Những đốm này mờ dần khi ếch lớn lên. Thường gặp trên các cành cây cách đất 3 - 4m ven các suối trong các khu rừng kín tán ở độ cao 400 - 600m. Chúng thích những nơi nhiều bóng râm đặc biệt là các khu rừng có nhiều suối nhỏ với lớp phủ thực vật rậm rạp gồm dương xỉ,  nơi có nhiều dây leo và thực vật phụ sinh. Thức ăn là các loài côn trùng sống trong khu vực phân bố.  Mùa sinh sản, con đực bám theo 1 con cái, các cặp đang giao phối gặp vào khoảng tháng ừ tháng 3 đến tháng 5. Trứng đẻ thành những ổ bọt trên cành cây cách đất 2 - 10m, ở trứng có kích thước lớn nhất lần 9cm, cách được vài mét. Nòng nọc rời khỏi ổ trứng sẽ được nước mưa cuốn vào suối gần đó. Thức ăn là các loài côn trùng sống trong khu vực phân bố.', NULL, ' có ở hầu hết ở các tỉnh có rừng thường xanh núi cao còn tốt như Quảng Nam, Gia Lai, Kontum, Đắc Lắc, Lâm Đồng, Ninh Thuận. ', NULL, 'Loài đặc hữu Việt Nam', 'Là loài ếch cây có hoa văn rất đẹp, nên chúng thường bị buôn bán làm vật nuôi cảnh ở Việt Nam và quốc tế. Có giá trị nghiên cứu khoa học về sinh thái và tập tính của loài.', NULL, NULL, NULL, 'vncreatures'),
(3339, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorusappendiculatus', 'Rhacophorus appendiculatus', 'Boulenger, 1882', 'Ếch cây sần', 'SPA_03359', 'Đầu dài bằng rộng; rộng đầu bằng chiều rộng thân. Mõm tròn, vượt quá hàm dưới. Răng lá mía tạo thành gờ rõ, xếp ngang, chạm bờ trước lỗ mũi trong; lưỡi hình bầu dục dài, phần gốc hẹp, đầu lưỡi xẻ đôi sâu. Gờ mõm tù, vùng trán, vùng má hơi lõm. Lỗ mũi nằm gần mõm hơn mắt; gian mũi bé hơn gian ổ mắt. Mắt lớn, đường kính mắt bé hơn gian ổ mắt một chút, lớn hơn chiều rộng mí mắt trên. Màng nhĩ rõ, nằm gần mắt; đường kính màng nhĩ bằng khoảng 1/2 lần đường kính mắt. Chi ngắn, khớp gối và khớp khuỷu không chạm nhau khi gập sát thân. Mút các ngón tay phình rộng thành đĩa, đĩa ngón I bé, đĩa ngón II, III và IV gần bằng nhau, lớn hơn đường kính màng nhĩ. Đĩa các ngón chân bé, kích thước đĩa các ngón: I < II < III < IV < V, đĩa ngón III bằng đường kính màng nhĩ. Màng giữa các ngón tay rộng, hoàn toàn trừ ngón I đến 1/2 chiều dài ngón; bàn tay có củ trong lồi, rõ, củ ngoài rõ, dẹp. Ngón chân có màng rộng, hoàn toàn, bàn chân có củ trong hình bầu dục, không có củ bàn ngoài. Bờ ngoài ống, cổ bàn tay có riềm da rộng; bờ ngoài ống chân có riềm da lồi lõm, riềm ở cổ bàn chân rõ. Khớp chày - cổ có riềm da lồi. Có 2 nếp da rõ ở phía sau lỗ huyệt. Da sần. Mặt trên thân màu nâu xám, bụng và dưới đùi vàng nâu, nổi hạt rõ. Cằm, họng và ngực trắng đục, hơi sần với các hạt nhỏ. Hai bên mép dưới sẫm màu với hai nếp hạt rõ. Màng giữa các ngón tay và ngón chân đen nhạt.', NULL, 'Việt Nam: Thừa Thiên-Huế - Vườn quốc gia Bạch Mã', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=2&loai=1&ID=5935'),
(3340, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorusbugeri', 'Rhacophorus bugeri', 'Smith, 1924', 'ếch cây', 'SPA_03360', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3341, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophoruscalcaneus', 'Rhacophorus calcaneus', 'Smith, 1924', 'Ếch cây cựa', 'SPA_03361', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3342, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorusdennysi', 'Rhacophorus dennysi', '(Blanford, 1881)', 'Ếch cây xanh đốm', 'SPA_03362', 'Là một trong những loài ếch cây lớn nhất châu Á, con đực có chiều dài thân tới 128mm, con cái tới 134mm. Đầu rộng hơn dài (HW 24,9 mm, HL 22,5 mm); mút mõm hơi tròn, lỗ mũi gần mút mõm hơn so với mắt (SNL 4,8 mm, NEL 6,6 mm); khoảng cách gian mũi nhỏ hơn gian mắt và lớn hơn chiều rộng mí mắt trên (IND 6,6 mm, IOD 9,6 mm, UEW 5,8 mm); màng nhĩ rõ, trịn, nhỏ hơn đường kính mắt (TD 4,1 mm, EL 7 mm); gờ da trên màng nhĩ rõ, có răng lá mía; lưỡi chẻ đơi ở phía sau. Con đực có một cặp túi kêu ở góac miệng. Tương quan chiều dài các ngón tay: I<II<IV<III, mút ngón tay có đĩa bâm lớn với rãnh ngang đĩa bám ngón tay III (FD3 3,4 mm) nhỏ hơn đường <II<III<V<IV, đĩa bám ở đầu ngón chân, nhỏ bằng khoảng 2/3 đĩa bám ở ngón tay (TD4 2,7 mm); chân có màng bơi rất lớn; riềm da phía ngoài ngón chân V và bàn chân không phát triển; không có cựa da ở gót chân; củ bàn trong nhỏ, không có củ bàn ngồi, củ dưới khớp ngón rõ; khi gập vuông góc với thân, gót chân chồng lên nhau, khi gập dọc thân, khớp cổ - bàn vượt quá lỗ mũi. Da mặt trên đầu, lưng và chi nhẵn; không có gờ da lưng sườn; không có nếp da phía trên hậu môn; họng và ngực nhẫn.', NULL, 'Trong nước: Cao Bằng, Băc Kạn, Lạng Sơn, Vĩnh Phúc, Bắc Giang, Hải Dương, Ninh Bình, Quảng Bình.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=2&loai=1&ID=5662'),
(3343, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorusdorsoviridis', 'Rhacophorus dorsoviridis', 'Bourret, 1937', 'ếch cây lưng xanh', 'SPA_03363', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3344, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorusexechopygus', 'Rhacophorus exechopygus', 'Inger, Orlov & Darevsky, 1999', 'Ếch cây nếp da mông', 'SPA_03364', 'Đầu rộng bằng hoặc hơn chiều rộng thân một chút. Răng lá mía tạo thành gờ mảnh, xếp ngang, không chạm nhau, chạm bờ trước lỗ mũi trong. Lưỡi dài, phần gốc hẹp, đầu lưỡi xẻ thuỳ rộng và sâu. Mõm tù hoặc hơi nhọn, vượt quá hàm dưới; gờ mõm không rõ, vùng trán và vùng má hơi lõm. Miệng rộng, đến giữa màng nhĩ. Màng nhĩ rõ, nằm gần mắt; đường kính màng nhĩ bằng khoảng 1/2 hoặc hơn một chút so với đường kính mắt. Mắt lớn; gian ổ mắt bằng khoảng 1,5 lần chiều rộng mí mắt trên. Lỗ mũi nằm gần sát mút mõm; đường kính mắt tương đương khoảng cách từ trước mắt đến mũi. Khớp gối và khớp khuỷu chạm nhau hoặc hơi gối lên nhau một chút khi gập sát thân. Mút ngón tay và ngón chân phình rộng; màng giữa các ngón tay hoàn toàn trừ ngón I, đĩa ngón tay I bé nhất, đĩa các ngón II, III và IV gần bằng nhau; đĩa ngón chân bé hơn đĩa ngón tay, màng giữa các ngón chân hoàn toàn, rộng.\n\nBàn tay có củ trong rõ, không có củ ngoài. Chân có củ bàn trong hình bầu dục dài, không có củ bàn ngoài. Bờ ngoài ống và cổ bàn tay có riềm da hẹp; ống chân không có riềm da, cổ bàn chân có riềm da hẹp. Khớp chày - cổ đến giữa mắt. Sau lỗ huyệt có nếp hạt.\nDa sần với các hạt nhỏ; bụng và dưới đùi có nốt sần lớn hơn. Mặt trên đầu, thân và các chi màu nâu; màng giữa các ngón chân màu nâu đỏ với các vệt đen mảnh, màu ở màng ngón tay nhạt hơn. Bụng màu trắng nhạt, đôi khi có các đốm đen nhỏ; phần bụng dưới và dưới đùi màu nâu nhạt. Con cái lớn hơn con đực. Kiếm ăn ban đêm, xuất hiện sau cơn mưa từ thàng 6 đến tháng 9 hằng năm ở các khu vực rừng thường xanh còn tốt. Thức ăn là các loài ấu trùng sống trong khu vực sinh sống. Đẻ trứng vào tháng 6 đến tháng 9 hàng năm ở Đồng Nai (Phùng Mỹ Trung)', NULL, 'Quảng Trị, Thừa Thiên-Huế, Quảng Nam, Kontum, Gia Lai, Phú Yên (Đại Lãnh), Đồng Nai (Mã Đà, Cát Tiên, Định Quán) ', NULL, NULL, 'Là loài ếch cây có hoa văn rất đẹp, nên chúng thường bị buôn bán làm vật nuôi cảnh ở Việt Nam và quốc tế. Có giá trị nghiên cứu khoa học, tim hiểu về sinh thái và tập tính của loài.', NULL, NULL, NULL, 'vncreatures'),
(3345, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorusfeae', 'Rhacophorus feae', 'Boulenger, 1893', 'Chẫu chàng phê', 'SPA_03365', 'Là một trong những loài ếch cây lớn thuộc giống Rhacophorus ở Việt Nam, thân dài đến 120 mm. Mặt trên lưng và trên các chi có mầu xanh lá cây, da nhẵn trừ mặt dưới bụng và đùi nổi hạt. Ngón tay, chân có đĩa rộng, có màng hoàn toàn. Hai bên đầu có một vệt nâu vàng chạy từ mõm viền trên mí mắt và màng nhĩ. Có khả năng thay đổi mầu sắc từ xanh lá cây sang xanh đen hay nâu tối phụ thuộc vào môi trường xung quanh. Thường sống ở những vùng rừng thường xanh kín tán hay rừng thứ sinh với nhiều cây bụi hay tre nứa quanh những vũng nước đọng cách không xa suối nước. Sâu về phía Nam, ở những vùng lầy lội hay gặp chúng trên những cây chuối hay bụi tre. Chúng đẻ trứng thành những ổ bọt làm trên đất hay trên cành cây cách đất 0,5m gần những con suối chảy xiết. Bị bắt con cái phát ra tiếng kêu rất to như tiếng gào của trẻ con. ở Việt Nam, loài này tìm thấy ở hai đỉnh núi cao: Fansipan (ở độ cao 1200 - 1800m) và Ngọc Linh (1500 - 2000m).', NULL, 'Lào Cai (Sa Pa), Kontum (Ngọc Linh). Mianma, bắc Thái Lan, bắc Lào, Trung Quốc (Vân Nam).', NULL, NULL, 'Có giá trị khoa học và thẩm mỹ, là loài có thể nuôi ở các vườn thú để giáo dục, nghiên cứu môi trường sống', 'EN', NULL, NULL, 'vncreatures'),
(3346, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorushelenae', 'Rhacophorus helenae', 'Rowley, Tran, Hoang & Le, 2012', 'Ếch cây Helen', 'SPA_03366', 'Loài có kích thước khá lớn, dài thân con đực 72.3–85.5 mm, con cái từ 89.4–90.7 mm. Mặt trên lưng và đầu màu xanh lá cây hay xanh dương với những đốm trắng. Bụng vàng nhạt, có đốm đen lớn trên nền vàng ở hai bên nách. Bàn chân tay có màng hoàn toàn, đĩa ngón rộng trên nền vàng nhạt của màng chân (màng tay của 3 ngón ngoài) có màu đen hay tím sẫm. Màng chân lớn, nếp da bên cánh tay rộng giúp ếch có thể liệng từ trên cây cao xuống. Gót chân có nếp da nhọn. Màu sắc con đực và con cái giống nhau.\nVề mặt hình thái loài ếch cây helen - Rhacophorus helenae rất giống loài ếch cây kio - Rhacophorus kio phân bố ở phía Bắc Việt Nam. Tuy nhiên chúng có những đặc điểm khác biệt về so sánh các mẫu DNA giữa hai loài và đặc điểm hình thái bên ngoài như kích thước lớn hơn, phần hậu môn sẻ xẻ thuỳ. Sống ở các vùng có độ cao thấp ở các khu rừng thường xanh và xuất kiện vào ban đêm trong các tháng mùa mưa nơi có những vũng nước lớn hay suối nhỏ trong rừng. Kiếm ăn và giao phối, đẻ trừng từ thàng 6 đến tháng 8 hàng năm. Nòng nọc được nở trong các bọc trứng khỏe mạnh trước khi rơi xuống các vũng nước. Tên loài được vinh danh mẹ của nhà nghiên cứu lưỡng cư người Úc – Tiến sỹ Rodi Lowley.', NULL, 'Đây là loài có vùng phân bố khá rộng, từ Khu bảo tồn thiên nhiên Núi Ông thuộc tỉnh Bình Thuận đến rừng phòng hộ đầu nguồn Tân Phú- Đồng Nai. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(3347, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophoruskio', 'Rhacophorus kio', 'Ohler and Delorme, 2006          ', 'Ếch cây Ki-o', 'SPA_03367', 'Là loài ếch cây khá lớn, dài thân con đực 58 - 79mm. Mặt trên lưng và đầu mầu xanh lá cây hay xanh dương với những đốm trắng. Bụng vàng tươi, có đốm đen lớn trên nền vàng ở hai bên nách. Bàn chân tay có màng hoàn toàn, đĩa ngón rộng trên nền vàng của màng chân (màng tay của 3 ngón ngoài) có mầu đen hay tím sẫm. Màng chân lớn, nếp da bên cánh tay rộng giúp ếch có thể liệng từ trên cây cao xuống. Gót chân có nếp da nhọn. Mầu sắc con đực và con cái giống nhau. Loài này gặp ở hầu khắp các rừng ở trung du và miền núi đến độ cao 1500m. Thức ăn của ếch cây kio là sâu non, cánh màng, kiến, đó là những con mồi có sẵn trên cây. Ếch cây kio sinh sản từ đầu tháng 4 cho đến hết tháng 8. Thời gian sinh sản tập trung vào tháng 4 - 5 (Buôn Lưới), tháng 7 - 8 (Bến En). Vào những đêm mưa, ếch tập trung quanh các hồ nước trên các cành cây, thường số lượng con đực gấp đôi con cái. Trời tối hẳn chúng liệng từ trên cây cao 3 - 5m xuống mặt hồ, ghép thành đôi, con cái cõng con đực leo lên các cành cây ven hồ và các con đực khác củng bám theo tạo thành một nhóm từ 5 - 7 con đực cùng giao phối với 1 con cái. Thời gian giao phối từ 1 - 4 giờ. Trứng được đẻ và thụ tinh luôn cuộn trong những chiếc lá tạo thành những ổ bọt dài 18 - 22cm treo lơ lửng cách đất 0,5 - 1m. Nòng nọc phát triển trong ổ bọt rồi rơi xuống nước.', NULL, 'Lào Cai (Sa Pa), Phú Thọ (Thanh Sơn, Vườn quốc gia Xuân Sơn), Thanh Hóa (Bến En), Hà Tĩnh (Hương Sơn), Quảng Bình (Phong Nha - Kẻ Bàng), Gia Lai (Buôn Lưới). Trung Quốc (Vân Nam, Quảng Tây), Lào, Thái Lan.', NULL, NULL, 'Có giá trị khoa học và thẩm mĩ. Có gía trị nghiên cứu khoa học về sinh thái và tập tính của loài.', 'EN', NULL, NULL, 'vncreatures'),
(3348, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorusleucomystax', 'Rhacophorus leucomystax', '(Gravenhorst, 1829)', 'ếch cây mép trắng', 'SPA_03368', 'Miệng rộng, mắt lớn và lồi, vượt rõ bờ hàm khi nhìn từ trên xuống. Răng lá mía dài, không chạm lỗ mũi tromh, xếp hình chữ V nông, không chạm nhau. Gờ mõm rõ, vùng má hơi lõm. Mắt lớn và lồi. Lỗ mũi gần sát mõm. Màng nhĩ rõ, đường kính màng nhĩ bằng 2/3-3/4 đường kính mắt. Chi và các ngón khá dài, mút các ngón tay, chân có đĩa bám. Đĩa ngón tay lớn hơn đĩa ngón chân, bằng khoảng 4/5 đường kính màng nhĩ. Màng bơi giữa các ngón tay rất bé và ở ngón chân chiếm ¾ có màng. Cũ khớp dưới ngón rõ, củ bản trong rõ có hình bầu dục. Khớp chày - cổ đạt tới mõm. Bờ ngoài ống tay, bàn tay, ống chân, bàn chân nhẵn. Da trên lưng nhẵn, mặt bụng và dưới các chi có các nốt sần nhỏ.\nThân màu nâu nhạt, có khi vàng nhạt, hoa văn của loài này khá đa dạng phụ thuộc vào vùng phân bố. Dạng thứ nhất trên lưng có 4 vệt màu nâu sẫm, hai vệt ở giựa bắt đầu từ mút mõm và 2 vệt hai bên bắt đầu từ trên mí mắt và mờ dần về phía chân sau.. Hai bên thân có vệt màu đen từ sau mắt đến ½ thân. Dạng thứ hai có hoa văn hình chữ X từ trên lưng, hai vệt đen kéo dài từ sau mắt qua màng nhĩ đến ½ thân ở mỗi bên. Dạng thứ ba có thân màu vàng nhạt với các chấm nhỏ màu nâu ở mặt trên đầu, lưng. Bụng màu trắng đục và các chi sau có các vệt sẫm màu vắt ngang.\nSinh học, sinh thái:\nLoài này sống trên cây trong các khu rừng thường xanh và các khu vực rừng phục hồi ở độ cao 10 đến 2000m. Ban ngày chúng ẩn trong các bụi cây, ban đêm chuyền ra kiếm ăn. Thức ăn là sâu non, cánh màng, kiến. Chúng di chuyển dễ dàng trên thân cây và cành lá cũng có thể nhảy từ cành nọ sang cành kia. Loài này sau khi được các nhà nghiên cứu Nhật Bản làm phân tích gen đã phát hiện ra là tên đồng danh của loài Rhacophorus mutus', NULL, 'Loài này phân bố khá rộng trong các nước thuộc khu vực Đông Nam á, Trung Quốc, Srilanka và Ấn Độ và ở nước ta ếch cây mép trắng phân bố ở Quảng Ninh, Bắc Bắc Giang, Lạng Sơn, Bắc Cạn, Hoà Bình, Hà Tây, Hà Tĩnh, Vĩnh Linh đến Kontum, Gia Lai, Đắc Lắc, Lâm Đồng, Đồng Nai.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5907'),
(3349, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorusmaximus', 'Rhacophorus maximus', 'Günther, 1858', 'Ếch cây lớn', 'SPA_03369', 'Đầu rộng hơn dài một chút, rộng hơn chiều rộng thân; mõm cụt ở phía trước; gờ mõm tù, vùng má hơi lõm. Răng lá mía dài, mảnh, xếp ngang, chạm bờ trước lỗ mũi trong; lưỡi hình bầu dục dài, phần gốc rộng, đầu lưỡi xẻ sâu. Lỗ mũi nằm sát mút mõm, khoảng cách từ mắt đến mũi gần bằng ường kính mắt. Mắt lớn và lồi, đường kính mắt lớn hơn chiều rộng mí mắt trên. Vùng trán rộng, lõm, gian ổ mắt lớn hơn ường kính mắt. Màng nhĩ rõ, đường kính màng nhĩ bằng khoảng 2/3 lần ường kính mắt. Có nếp da từ sau mắt kéo dài qua màng nhĩ đến trước vai. Miệng rộng, đến 1/2 màng nhĩ. Chi dài, khớp gối và khớp khuỷu gối lên nhau rõ khi gập sát thân. Mút ngón tay và ngón chân phình rộng thành đĩa, đĩa ngón tay lớn hơn đĩa ngón chân. Đĩa ngón tay II, III và IV lớn hơn ường kính màng nhĩ; đĩa ngón chân gần bằng đường kính màng nhĩ. Màng giữa các ngón tay II, III, IV rộng, hoàn toàn, màng ngón I đến 1/2 ngón; màng giữa các ngón chân rộng, hoàn toàn. Củ bàn tay trong lớn, nổi rõ, không có củ ngoài. Bàn chân có củ trong nhỏ, hình bầu dục. Bờ ngoài ống và cổ bàn tay có riềm da lớn, tạo thành nếp da ở ngón IV. Riềm da ở cổ bàn chân nhỏ hơn, cũng tạo thành nếp da ở ngón V. Bờ ngoài ống chân không có riềm da. Không có nếp da sau lỗ huyệt.', NULL, 'Trong nước: Vườn quốc gia Phong Nha - Kẻ Bàng, Thừa Thiên - Huế, Vườn quốc gia Bạch Mã, Nghệ An, Hà Tĩnh, Quảng Bình.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5980'),
(3350, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorusnigropalmatus', 'Rhacophorus nigropalmatus', 'Boulenger', 'Ếch cây', 'SPA_03370', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3351, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorusorlovi', 'Rhacophorus orlovi', 'Ziegler and Köhler, 2001          ', 'Ếch cây Orlov', 'SPA_03371', 'Thân mảnh, dẹp; đầu dài hơn rộng một chút. Răng lá mía ngắn, hẹp, cách xa nhau, chạm bờ trước lỗ mũi trong; lưỡi xẻ thuỳ ở phía sau. Mõm hơi nhọn, gờ mõm rõ, vùng má gần phẳng. Lỗ mũi ở phía bên, nằm gần sát mút mõm. Màng nhĩ rõ, bằng khoảng 2/3 đường kính mắt. Cằm có vết lõm. Có nếp da mảnh từ sau mắt kéo dài qua màng nhĩ đến 1/2 thân. Mút ngón tay và ngón chân phình thành đĩa, đĩa ngón tay lớn hơn đĩa ngón chân một chút, bằng 1/2 đường kính màng nhĩ. Ngón tay có 1/2 màng trừ ngón I, kích thước các ngón I < II < IV < III; ngón chân có màng gần hoàn toàn. Củ bàn trong dài, nhỏ, không có củ bàn ngoài. Khớp chày - cổ đạt tới mõm.\n\nDa trên đầu, lưng và các chi nhẵn; da vùng bụng và mặt dưới đùi nổi các nốt sần nhỏ. Trên lưng màu xanh ngọc nhạt, giữa lưng có đốm màu nâu nhạt lớn cùng màu với mặt trên của chi trước, chi sau và từ sau màng nhĩ đến vai. Phần mõm màu nâu sẫm hơn. Phần bẹn và mặt sau đùi sẫm màu với các đốm sáng rõ. Kiếm ăn ban đêm, xuất hiện sau cơn mưa từ tháng 6 đến tháng 9 hằng năm ở các khu vực rừng thường xanh còn tốt. Thức ăn là các loài ấu trùng sống trong khu vực sinh sống. Đẻ trừng vào tháng mùa mưa hằng năm.', NULL, 'Việt Nam: Lào Cai, Ninh Bình, Nghệ An, Hà Tĩnh, Quảng Bình, Quảng Trị, Thừa Thiên-Huế, Kon Tum, Gia Lai. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vn Creature'),
(3352, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorusreinwardtii', 'Rhacophorus reinwardtii', '(Schlegel, 1840)', NULL, 'SPA_03372', 'Đặc điểm nhận dạng:\n\nLà loài ếch cây khá lớn, dài thân con đực 58 - 79mm. Mặt trên lưng và đầu mầu xanh lá cây hay xanh dương với những đốm trắng. Bụng vàng tươi, có đốm đen lớn trên nền vàng ở hai bên nách. Bàn chân tay có màng hoàn toàn, đĩa ngón rộng trên nền vàng của màng chân (màng tay của 3 ngón ngoài) có mầu đen hay tím sẫm. Màng chân lớn, nếp da bên cánh tay rộng giúp ếch có thể liệng từ trên cây cao xuống. Gót chân có nếp da nhọn. Mầu sắc con đực và con cái giống nhau.\n\nSinh học,sinh thái:\n\nLoài này gặp ở hầu khắp các rừng ở trung du và miền núi đến độ cao 1500m. Thức ăn của ếch cây kio là sâu non, cánh màng, kiến, đó là những con mồi có sẵn trên cây. Ếch cây kio sinh sản từ đầu tháng 4 cho đến hết tháng 8. Thời gian sinh sản tập trung vào tháng 4 - 5 (Buôn Lưới), tháng 7 - 8 (Bến En). Vào những đêm mưa, ếch tập trung quanh các hồ nước trên các cành cây, thường số lượng con đực gấp đôi con cái. Trời tối hẳn chúng liệng từ trên cây cao 3 - 5m xuống mặt hồ, ghép thành đôi, con cái cõng con đực leo lên các cành cây ven hồ và các con đực khác củng bám theo tạo thành một nhóm từ 5 - 7 con đực cùng giao phối với 1 con cái. Thời gian giao phối từ 1 - 4 giờ. Trứng được đẻ và thụ tinh luôn cuộn trong những chiếc lá tạo thành những ổ bọt dài 18 - 22cm treo lơ lửng cách đất 0,5 - 1m. Nòng nọc phát triển trong ổ bọt rồi rơi xuống nước.', NULL, 'Trong nước: Lào Cai (Sa Pa), Phú Thọ (Thanh Sơn, Vườn quốc gia Xuân Sơn), Thanh Hóa (Bến En), Hà Tĩnh (Hương Sơn), Quảng Bình (Phong Nha - Kẻ Bàng), Gia Lai (Buôn Lưới).\n\nThế giới: Trung Quốc (Vân Nam, Quảng Tây), Lào, Thái Lan.', NULL, NULL, 'Có giá trị khoa học và thẩm mĩ. Có gía trị nghiên cứu khoa học về sinh thái và tập tính của loài.', 'EN', NULL, NULL, 'vncreatures.'),
(3353, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorusrhodopus', 'Rhacophorus rhodopus', 'Liu&Hu, 1960', 'Ếch cây màng bơi đỏ', 'SPA_03373', 'Con đực có chiều dài thân 40mm, con cái lớn hơn con đực và có kích thước khoảng 56mm. Màu sắc ban ngày khác với màu sắc ban đêm, ban ngày có màu nâu vàng hay nâu xám, các kẽ chân, tay, dùi và màng bơi có màu đỏ cam. Ban đêm có màu đỏ thẫm, bụng màu vàng rực. Trên thân có một số nốt màu đen và các đốm vàng lớn mà ở một số cá thể không có các đặc điểm này. Màu sắc khá tương đồng giữa cá thể đực và cá thể cái. kích thước ngón I < II < IV < III; màng ngón chân hoàn toàn. Củ bàn trong dài, không có củ bàn ngoài. Bờ ngoài cổ bàn tay có riềm da nhỏ. Chi sau trung bình, khớp chày - cổ đạt tới mũi, khớp cổ - bàn vượt mõm một chút. Sau cổ chân có mấu da nhọn khoảng 2mm. Có nếp da trên lỗ huyệt, 2 mấu gai nhỏ dưới lỗ huyệt.', NULL, 'Loài đặc hữu Việt Nam, phân bố ở các tỉnh Hà Tĩnh, Quảng Nam, Gia Lai, Kontum. Lâm Đồng.', NULL, NULL, 'Là loài lưỡng cư sống ở trên cây có hoa văn rất đẹp, nên chúng thường bị buôn bán làm vật nuôi cảnh ở Việt Nam và quốc tế. Có giá trị nghiên cứu khoa học về sinh thái và tập tính của loài.', NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5970'),
(3354, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorusrobertingeri', 'Rhacophorus robertingeri', 'Smith, 1924', 'Ếch cây cựa ', 'SPA_03374', 'Đặc điểm nhận dạng:\nDài thân con đực 41mm, con cái 59mm. Màu sắc rất thay đổi, không có sự khác biệt về màu sắc giữa con đực và con cái- Trên lưng màu nâu vàng, đôi khi có các đốm trắng nhỏ. Bên sườn có những đốm to màu da cam hay vàng nhạt mà nhiều khi chúng dính với nhau thành những hình không cố định. Bụng xám vàng màu sắc giữa ban ngày và ban đêm khác nhau, ban ngày màu nhạt hơn và những họa tiết hầu như không rõ. Phía cuối cẳng chân có một mấu gai lồi nhọn (giống cựa) làm chân như có vẻ dài thêm.\n\nMút ngón tay và ngón chân phình thành đĩa bám dẹt, đĩa ngón tay lớn hơn đĩa ngón chân tương ứng. Ngón tay có màng gần hoàn toàn trừ ngón I; kích thước ngón I < II < IV < III; màng ngón chân hoàn toàn. Củ bàn trong dài, không có củ bàn ngoài. Bờ ngoài cổ bàn tay có riềm da nhỏ. Chi sau trung bình, khớp chày - cổ đạt tới mũi, khớp cổ - bàn vượt mõm một chút. Sau cổ chân có mấu da nhọn khoảng 2 mm. Có nếp da trên lỗ huyệt, 2 mấu gai nhỏ dưới lỗ huyệt.\n\nNơi sống, sinh thái:\n\nThường gặp trên các cành cây cách đất 3 - 4m ven các suối trong các khu rừng kín tán ở độ cao 700-200m. Chúng thích những nơi nhiều bóng râm đặc biệt là các khu rừng có nhiều suối nhỏ với lớp phủ thực vật rậm rạp gồm dương xỉ, cọ bị quấn nhiều dây leo và thực vật phụ sinh. Thức ăn là các loài côn trùng sống trong khu vực phân bố.  Mùa sinh sản, con đực bám theo 1 con cái, các cặp đang giao phối gặp vào khoảng tháng 4 đến tháng 10. Trứng đẻ thành những ổ bọt trên cành cây cách đất 0,5-2m, ở trứng có kích thước lớn nhất lần 9cm, cách được vài mét. Nòng nọc rời khỏi ổ trứng sẽ được nước mưa cuốn vào suối gần đó.', NULL, ' phân bố ở các tỉnh Hà Tĩnh, Quảng Nam, Gia Lai, Kontum. Lâm Đồng.', NULL, 'Loài đặc hữu Việt Nam', 'Là loài ếch cây có hoa văn rất đẹp, nên chúng thường bị buôn bán làm vật nuôi cảnh ở Việt Nam và quốc tế. Có giá trị nghiên cứu khoa học về sinh thái và tập tính của loài.', NULL, NULL, NULL, NULL),
(3355, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorussapa', 'Rhacophorus chapaensis', '(Bourret, 1937)', ' ', 'SPA_03375', 'Là loài ếch cây khá lớn, dài thân con đực 58 - 79mm. Mặt trên lưng và đầu mầu xanh lá cây hay xanh dương với những đốm trắng. Bụng vàng tươi, có đốm đen lớn trên nền vàng ở hai bên nách. Bàn chân tay có màng hoàn toàn, đĩa ngón rộng trên nền vàng của màng chân (màng tay của 3 ngón ngoài) có mầu đen hay tím sẫm. Màng chân lớn, nếp da bên cánh tay rộng giúp ếch có thể liệng từ trên cây cao xuống. Gót chân có nếp da nhọn. Mầu sắc con đực và con cái giống nhau.\nSinh học, sinh thái:\nLoài này gặp ở hầu khắp các rừng ở trung du và miền núi đến độ cao 1.500m. Thức ăn của ếch cây kio là sâu non, cánh màng, kiến, đó là những con mồi có sẵn trên cây. Ếch cây kio sinh sản từ đầu tháng 4 cho đến hết tháng 8. Thời gian sinh sản tập trung vào tháng 4 - 5 (Buôn Lưới), tháng 7 - 8 (Bến En). Vào những đêm mưa, ếch tập trung quanh các hồ nước trên các cành cây, thường số lượng con đực gấp đôi con cái. Trời tối hẳn chúng liệng từ trên cây cao 3 - 5m xuống mặt hồ, ghép thành đôi, con cái cõng con đực leo lên các cành cây ven hồ và các con đực khác củng bám theo tạo thành một nhóm từ 5 - 7 con đực cùng giao phối với 1 con cái. Thời gian giao phối từ 1 - 4 giờ. Trứng được đẻ và thụ tinh luôn cuộn trong những chiếc lá tạo thành những ổ bọt dài 18 - 22cm treo lơ lửng cách đất 0,5 - 1m. Nòng nọc phát triển trong ổ bọt rồi rơi xuống nước. Rhacophorus kio bụng trắng, có riềm da thuỳ huyệt. Màu nền xanh lá ánh xam lam có hoa văn vàng nhạt ở sau đùi, kích thước cũng lớn hơn Rhacophorus kio so với Rhacophorus helenae.', NULL, 'Trong nước: Lào Cai (Sa Pa), Phú Thọ (Thanh Sơn, Vườn quốc gia Xuân Sơn), Thanh Hóa (Bến En), Hà Tĩnh (Hương Sơn), Quảng Bình (Phong Nha - Kẻ Bàng), Gia Lai (Buôn Lưới).\nNước ngoài: Trung Quốc (Vân Nam, Quảng Tây), Lào, Thái Lan.', NULL, NULL, 'Có giá trị khoa học và thẩm mĩ. Có gía trị nghiên cứu khoa học về sinh thái và tập tính của loài.', ' EN B1+ 2a,b,c,d.', NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=5&loai=1&ID=5105'),
(3356, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorussmaragdinus', 'Rhacophorus smaragdinus', '(Blyth, 1852)', 'Ếch cây lớn', 'SPA_03376', 'Đầu rộng hơn dài một chút, rộng hơn chiều rộng thân; mõm cụt ở phía trước; gờ mõm tù, vùng má hơi lõm. Răng lá mía dài, mảnh, xếp ngang, chạm bờ trước lỗ mũi trong; lưỡi hình bầu dục dài, phần gốc rộng, đầu lưỡi xẻ sâu. Lỗ mũi nằm sát mút mõm, khoảng cách từ mắt đến mũi gần bằng ường kính mắt. Mắt lớn và lồi, đường kính mắt lớn hơn chiều rộng mí mắt trên. Vùng trán rộng, lõm, gian ổ mắt lớn hơn ường kính mắt. Màng nhĩ rõ, đường kính màng nhĩ bằng khoảng 2/3 lần ường kính mắt. Có nếp da từ sau mắt kéo dài qua màng nhĩ đến trước vai. Miệng rộng, đến 1/2 màng nhĩ. Chi dài, khớp gối và khớp khuỷu gối lên nhau rõ khi gập sát thân. Mút ngón tay và ngón chân phình rộng thành đĩa, đĩa ngón tay lớn hơn đĩa ngón chân. Đĩa ngón tay II, III và IV lớn hơn ường kính màng nhĩ; đĩa ngón chân gần bằng đường kính màng nhĩ. Màng giữa các ngón tay II, III, IV rộng, hoàn toàn, màng ngón I đến 1/2 ngón; màng giữa các ngón chân rộng, hoàn toàn. Củ bàn tay trong lớn, nổi rõ, không có củ ngoài. Bàn chân có củ trong nhỏ, hình bầu dục. Bờ ngoài ống và cổ bàn tay có riềm da lớn, tạo thành nếp da ở ngón IV. Riềm da ở cổ bàn chân nhỏ hơn, cũng tạo thành nếp da ở ngón V. Bờ ngoài ống chân không có riềm da. Không có nếp da sau lỗ huyệt.', NULL, 'Trong nước: Vườn quốc gia Phong Nha - Kẻ Bàng, Thừa Thiên - Huế, Vườn quốc gia Bạch Mã, Nghệ An, Hà Tĩnh, Quảng Bình.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5980'),
