(3359, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorussp3', 'Rhacophorus sp3.', NULL, 'Êch cây (hoa)', 'SPA_03379', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3360, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Rhacophorus', NULL, 'GEN_1724', 'rhacophorusverucosus', 'Rhacophorus verucosus', 'Boulenger 1893', 'Ếch cây sần nhỏ', 'SPA_03380', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3361, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Theloderma', NULL, 'GEN_1952', 'thelodermaalbopunctatus', 'Theloderma albopunctatus', '(Boulenger, 1886)', 'Ếch cây sần a-x-pơ', 'SPA_03381', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3362, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Theloderma', NULL, 'GEN_1952', 'thelodermaasperum', 'Theloderma asperum', '(Boulenger, 1886)            ', 'Êch cây At pơ', 'SPA_03382', 'Loài ếch sống trên cây có kích thước rất nhỏ, dài thân khoảng 37mm. Da sần sùi ở nửa thân về phía đầu, mông và gót chân mầu trắng hoặc màu hồng nhạt rất cân đối. Màng nhĩ rõ rộng bằng mắt. Các chi và giữa lưng có mầu nâu mốc sẫm. Mắt màu hồng. Giữa đỉnh đầu có một mảng màu đen nối liền 2 mắt. Chân 3/4 có màng bơi mỏng.. Các khu vực rừng từ độ cao 400 - 1.500m. Con trưởng thành sống trong các bọng cây to hay cây đổ có chứa nước mưa. Mùa sinh sản từ tháng 4 tới tháng 10. Trứng đẻ thành đám 5 - 6 quả dính vào thành bọng cây phía trên mặt nước, nòng nọc khi phát triển sẽ rơi vào trong nước. Thức ăn là các loài côn trùng sống trong khu vực, các loài ấu trùng của muỗi', NULL, 'Việt Nam: Hà Giang, Lào Cai, Tuyên Quang Vĩnh Phúc, Phú Thọ, Ninh Bình, Nghệ An, Hà Tĩnh, Quảng Bình, Đồng Nai. Thế giới: Cambodia, Trung Quốc, Ấn Độ, Indonesia, Lào, Malaysia, Myanmar, Thailand.', NULL, NULL, NULL, NULL, NULL, NULL, 'Vn Creature'),
(3363, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Theloderma', NULL, 'GEN_1952', 'thelodermabambusicolum', 'Theloderma bambusicolum', '(Smith, 1924)', 'Nhái cây tre', 'SPA_03383', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3364, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Theloderma', NULL, 'GEN_1952', 'thelodermabicolor', 'Theloderma bicolor', '(Bourret, 1937)', 'ếch cây hủi', 'SPA_03384', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3365, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Theloderma', NULL, 'GEN_1952', 'thelodermacorticale', 'Theloderma corticale', '(Boulenger, 1903)', 'Ếch cây sần Bắc Bộ', 'SPA_03385', 'Dài thân con cái 70 - 75mm, con đực 60 - 70mm. Da sần sùi nổi hạt với những mảng mầu xanh rêu xen lẫn nâu đất không có hình dáng cố định trông giống như một đám rêu. Đĩa ngón tay lớn. Con đực không có túi kêu. Ngón tay không màng hoặc chỉ có màng nhỏ giữa ngón 3 - 4. Ngón chân có màng hoàn toàn. Màng nhĩ nhỏ hơn đường kính mắt. Sống trong các hang đá vôi nhỏ dưới các thác nước hay trên các thành đá ven các suối hoàn toàn bị che phủ bởi tán rừng rậm ở độ cao 900 - 1600m. Loài này cũng tìm thấy trong các bể nước mưa ở tầng hầm các biệt thự cũ của Pháp còn sót lại trên Vườn quốc gia Tam Đảo. Thời gian sinh sản từ tháng 4 - 6. ở loài này không thấy hiện tượng đa thê như ở loài Theloderma stellatum và Theloderma asperum. Trứng đẻ thành từng đám nhỏ 6 - 17 quả, có vỏ nhầy rất dầy dính chặt vào trần và vách ẩm của hốc đá. Số lượng trứng đẻ một lần đạt đến 60 quả chia thành 3 - 5 đám nhỏ riêng biệt. Dinh dưỡng của loài chưa được nghiên cứu', NULL, 'Trong nước: Cao Bằng, Tuyên Quang (Na Hang), Lạng Sơn (Mẫu Sơn), Vĩnh Phúc (Tam Đảo) ', NULL, ' Loài đặc hữu, chỉ có ở Việt Nam.', 'Có giá trị khoa học và thẩm mỹ, là một trong những loài ếch lạ, đẹp. đây là loài duy nhất thuộc giống Theloderma được đưa vào sách đỏ Việt Nam.', 'EN', 'DD', NULL, 'Vn Creature'),
(3366, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Theloderma', NULL, 'GEN_1952', 'thelodermagordoni', 'Theloderma dordoni', 'Taylor, 1962', 'Ếch cây sần go - đôn', 'SPA_03386', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
