(3369, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Theloderma', NULL, 'GEN_1952', 'thelodermapetilum', 'Theloderma petilum', '(Stuart&Heatwole, 2004)', 'Ếch cây sần mảnh', 'SPA_03389', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3370, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Theloderma', NULL, 'GEN_1952', 'thelodermarhododiscus', 'Theloderma rhododiscus', '(Liu & Hu, 1962)', 'Ếch cây sần Trung Quốc', 'SPA_03390', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3371, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Theloderma', NULL, 'GEN_1952', 'thelodermastellatum', 'Theloderma stellatum', '(Taylor, 1962)            ', 'Ếch cây sần tay-lơ', 'SPA_03391', 'Loài ếch cây có kích thước nhỏ, dài thân khoảng 42mm. Da sần sùi khắp cơ thể và chủ yếu ở phần lưng, với các sọc màu nâu xám và xám nhạt ở chân trước và chân sau. Ở nửa thân về phía đầu là những mảng màu đen và vàng nhạt. Mông có một mảng màu xám nhạt với các nốt sần to khá rõ. Màng nhĩ rõ rộng bằng mắt. Mắt màu đen. Chân 3/4 có màng bơi mỏng, ngón chân có các đĩa bám rất rõ, phần trên đĩa bám ở cả chân trước và chân sau có màu nâu đậm', NULL, 'Việt Nam: Gia Lai, Kontum, Đắc Lắc (Yok Đôn), An Giang (vùng Bảy Núi), Bà Rịa Vũng Tàu (núi Dinh) Đồng Nai (Cát Tiên), Khánh Hòa (Đại Lãnh).', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=1&loai=1&ID=5657'),
(3372, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Theloderma', NULL, 'GEN_1952', 'thelodermatruongsonensis', 'Theloderma truongsonensis', 'Orlov and Ho, 2005', 'Nhái cây Trường Sơn', 'SPA_03392', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3373, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'ANURA', 'KHÔNG ĐUÔI', 'ORD_004', 'Rhacophoridae', 'Ếch Cây', 'FAM_319', 'Theloderma', NULL, 'GEN_1952', 'thelodermavietnamense', 'Theloderma vietnamense', 'Poyarkov et al, 2015', 'Ếch mắt bọ miền Nam', 'SPA_03393', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3374, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'CAUDATA', 'CÓ ĐUÔI', 'ORD_014', 'Salamandridae', 'Cá Cóc', 'FAM_325', 'Paramesotriton', NULL, 'GEN_1455', 'paramesotritonguanxiensis', 'Paramesotriton guanxiensis', '(Huang, Tang & Tang, 1983)', 'Cá cóc Quảng Tây', 'SPA_03394', 'Cá cóc quảng tây: Kích thước trung bình trong nhóm Cá cóc Paramesotriton sp. nhỏ hơn Cá cóc tam đảo Paramesotriton deloustali. Chiều dài toàn thân từ 12,5 - 14,cm ở cá thể đực và khoảng 13,4cm ở cá thể cái. Thân mập mạp và khá phẳng. Mõm bằng. Nếp gấp ở môi khá phát triển. Đầu phẳng, hình tam giác, chiều dài lớn hơn chiều rộng. Khi gập chi trước và chi sau vào nhau, các ngón chân vừa chạm sát nhau. Da có các nếp nhăn nhỏ. Sống lưng nhô cao, kéo dài đến đuôi. Chiều dài đuôi ngắn hơn chiều dài thân, mút đuôi mỏng. Lỗ huyệt nổi rõ, đặc biệt dễ dàng quan sát ở các cá thể đực trong mùa sinh. Mặt trên màu nâu sẫm, mặt dưới có màu đen với các đốm màu vàng hoặc cam không đều khác với Cá cóc tam đảo Paramesotriton deloustali. Đường vây dưới đuôi màu vàng và nhạt dần về phía mút đuôi. Cá thể cái có màu nhạt hơn.', NULL, 'Cá cóc quảng tây được ghi nhận đầu tiên ở tỉnh Quảng Tây - Trung Quốc ở độ cao khoảng 47m so với mặt nước biển. Ở Việt Nam, loài này được ghi nhận tại huyện Nguyên Bình, tỉnh Cao Bằng. ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=4&loai=1&ID=6047'),
(3375, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'CAUDATA', 'CÓ ĐUÔI', 'ORD_014', 'Salamandridae', 'Cá Cóc', 'FAM_325', 'Tylototriton', NULL, 'GEN_2006', 'tylototritonanguliceps', 'Tylototriton anguliceps', 'Le, Nguyen, Nishikawa, Nguyen, Pham, Matsui, Bernardes&Nguyen, 2015', 'Cá cóc gờ sọ mảnh', 'SPA_03395', 'Con trưởng thành có màu từ nâu sẫm đến đen, với đầu, chi, đuôi và các vết màu cam sáng, cũng như các đường gờ lưng và lưng bên nổi bật trên đầu, giúp phân biệt loài này với các loài khác. Chúng có bốn ngón tay và năm ngón chân đều không có màng. Con đực có xu hướng nhỏ hơn con cái nhưng có các chi khỏe mạnh hơn. Chiều dài mõm ở con cái cũng lớn hơn, dao động từ 65,4mm - 74,1mm ở con cái và 61,1 - 62,5 ở con đực. [5]', NULL, 'Việt Nam, Lào và Thái Lan. [2] Lần đầu tiên nó được phát hiện ở huyện Mường Nhé và huyện Thuận Châu ở Việt Nam và Doi Lahnga, một ngọn núi ở tỉnh Chiang Mai ở Thái Lan, vào năm 2015. [3] Mặc dù chưa có bất kỳ phát hiện nào ở các quốc gia khác, nhưng vẫn chưa có phát hiện nào ở các quốc gia khác. có suy đoán rằng kỳ nhông cũng có thể sinh sống ở miền nam Trung Quốc và miền tây Myanmar. Đây là một trong bốn loài duy nhất được biết đến trong chi Tylototriton sống ở Lào', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Tylototriton_anguliceps'),
(3376, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'CAUDATA', 'CÓ ĐUÔI', 'ORD_014', 'Salamandridae', 'Cá Cóc', 'FAM_325', 'Tylototriton', NULL, 'GEN_2006', 'tylototritonasperrimus', 'Tylototriton asperrimus', 'Unterstein 1930', 'Cá cóc sần', 'SPA_03397', 'Loài cá cóc này có hình dạng giống thằn lằn màu nâu sẫm, chiều dài thân loài cá cóc này từ khoảng dài khoảng 5–9 cm. So với cá cóc Tam Đảo và cá cóc Việt Nam, chúng có lớp da sần sùi hơn và màu sẫm hơn. Cá cóc sần từng bị nhầm lẫn với cá cóc Việt Nam do rất giống nhau ở màu vàng cam đầu các chi, mép dưới đuôi, viền quanh lỗ hậu môn. Đầu rộng, tuyến mang tai gồ cao, phình rộng, hơi xiên về phía sau gờ giữa sống lưng gồ cao với nhưng u lồi khá lớn chạy dọc hai bên sườn từ phía sau chi trước đến gốc đuôi.[4] Giữa sống lưng của cá có gồ nổi kéo dài tiếp nối với đuôi hai bên sườn và có nhiều khối u tròn lồi khá lớn chạy từ chi trước đến gốc đuôi.[2]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/C%C3%A1_c%C3%B3c_s%E1%BA%A7n'),
(3377, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'CAUDATA', 'CÓ ĐUÔI', 'ORD_014', 'Salamandridae', 'Cá Cóc', 'FAM_325', 'Tylototriton', NULL, 'GEN_2006', 'tylototritonlrifasciata', 'Tylototriton lrifasciata', '(Bell, 1825).', 'Sa giông Việt Nam', 'SPA_03398', 'Loài sa giông mới khi trưởng thành được phát hiện tại Việt Nam có làn da thô, sần sùi như da cá sấu nên được gọi là “sa giông cá sấu”. Ngoài ra, ở đầu ngón của các chi loài sa giông này có màu da cam.', NULL, 'Con đực có chiều dài cơ thể khoảng 5,4-6,8cm, trong khi con cái đo được tới 7,1cm.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://tuoitre.vn/phat-hien-loai-sa-giong-moi-o-viet-nam-538892.htm#:~:text=Chi%20sa%20gi%C3%B4ng%20thu%E1%BB%99c%20h%E1%BB%8D,n%C3%A0y%20c%C3%B3%20m%C3%A0u%20da%20cam.'),
(3378, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'GYMNOPHIONA', 'KHÔNG CHÂN', 'ORD_039', 'Ichthyophiidae', 'Ếch Giun', 'FAM_197', 'Ichthyophis', NULL, 'GEN_0948', 'ichthyophisbannanicus', 'Ichthyophis bananicus', 'Yang, 1984', 'Ếch giun', 'SPA_03399', 'Môi trường sinh sống của chúng ở các khu vực nhiệt đới và cận nhiệt đới, trong các ao hồ, sông, vùng ngập nước. Chúng đang bị đe doạ bởi mất nơi sinh sống.', NULL, 'Ếch giun Bản Nạp (danh pháp hai phần: Ichthyophis bannanicus) là một loài ếch giun thuộc chi Ichthyophis. Loài này sinh sống ở Trung Quốc (các tỉnh Vân Nam, Quảng Tây, Quảng Đông), có thể có ở Lào, Myanmar, Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/%E1%BA%BEch_giun_B%E1%BA%A3n_N%E1%BA%A1p#:~:text=%E1%BA%BEch%20giun%20B%E1%BA%A3n%20N%E1%BA%A1p%20(danh,L%C3%A0o%2C%20Myanmar%2C%20Vi%E1%BB%87t%20Nam.'),
(3379, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'GYMNOPHIONA', 'KHÔNG CHÂN', 'ORD_039', 'Ichthyophiidae', 'Ếch Giun', 'FAM_197', 'Ichthyophis', NULL, 'GEN_0948', 'ichthyophisglutinosus', 'Ichthyophis glutinosus', 'Taylor, 1960', 'Ếch giun bana ', 'SPA_03400', 'Đặc điểm nhận dạng:\n\nLoài lưỡng cư không chân có hình dáng giống giun, nhưng lớn hơn, thân dài từ 100 - 380mm. Mắt như hai chấm đen, không mi. Đầu nhỏ hơi dẹp, mõm tương đối nhọn và có hàm rõ. Lưng mầu nâu đen, bụng nhạt hơn. ở mỗi bên thân có một dải mầu vàng chạy dài từ góc hàm tới gốc đuôi. Nòng nọc có mang ngoài ở hai bên cổ.\n\nSinh học, sinh thái:\n\nẾch giun sống chui luồn trong đất ở độ sâu 20 - 30 cm. Hang của chúng thường gặp ở những nơi đất xốp, ẩm ven suối, hồ nước, ruộng lúa trên độ cao có thể lên tới 900m (như ở dãy Tam Đảo). ếch giun ăn giun đất. Con cái trưởng thành có chiều dài khoảng 350mm. Chúng đẻ trứng ở gần chỗ có nước, mỗi lứa chừng 30 quả trong khoảng tháng 4 - 6, các trứng được nối với nhau bằng các chất nhầy mà các cá thể cái cuộn lấy để bảo vệ trứng khỏi khô người ta thường gọi không đúng là hiện tượng \"\"ấp trứng\"\". Vòng đời của loài Lưỡng cư không chân biến thái hoàn toàn này cũng trải qua 3 giai đoạn như các loài lưỡng cư khác.', NULL, 'Trong nước: Tam Đảo (Vĩnh Phúc), Phú Thọ (Xuân Sơn), Thừa Thiên - Huế (A Lưới), Tây Ninh, Đồng Nai, thành phố Hồ Chí Minh, Kiên Giang (Hà Tiên), Cà Mau (U Minh).\n\nThế giới: Trung Quốc (Vân Nam).', NULL, NULL, 'Loài ếch nhái thuộc bộ Không chân Apoda ở Việt Nam, có giá trị khoa học rất lớn trong các nghiên cứu về loài lưỡng cư không chân này.', 'VU', NULL, NULL, NULL),
(3380, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AMPHIBIA', 'LƯỠNG CƯ', 'CLA_02', 'GYMNOPHIONA', 'KHÔNG CHÂN', 'ORD_039', 'Ichthyophiidae', 'Ếch Giun', 'FAM_197', 'Ichthyophis', NULL, 'GEN_0948', 'ichthyophisnguyenorum', 'Ichthyophis nguyenorum', 'Nishikawa, Matsui & Orlov 2012', 'Ếch giun', 'SPA_03401', 'Loài lưỡng cư không chân mới được phát hiện năm 2012 có chiều dài toàn bộ cơ thể khoảng 265 - 307 mm. Cơ thể hình trụ, hơi dẹp ở mặt bụng; dài đuôi 2,5 - 3,1 mm, rộng đuôi 3,4 - 4,3mm, mút đuôi tròn, không có núm che; số đốt dọc thân khoảng 312 - 318 trong đó có 4 đốt ở phần đuôi, số răng trước hàm và răng hàm trên khoảng 27 - 37, số răng lá mía - vòm miệng khoảng 23 - 28, số răng chính thức 24 - 28, số gờ răng khoảng 21 - 25. Mặt lưng có màu tím đen, dưới bụng nhạt hơn màu hoa cà, hai bên sườn có sọc màu vàng liên tục, không đứt quãng, chạy từ khoảng giữa hàm trên (mấu xúc - tu) đến gần mút đuôi. Mắt có viền mỏng màu trắng đục.', NULL, 'Loài mới phát hiện này có vùng phân bố ở cao nguyên Kontum, miền Trung Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=6210'),
(3381, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'ANSERIFORMES', 'NGỖNG', 'ORD_003', 'Anatidae', 'Vịt', 'FAM_018', 'Aix', NULL, 'GEN_0055', 'aixgalericulata', 'Aix galericulata', '(Linnaeus,1758)            ', 'Uyên ương', 'SPA_03402', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3382, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'ANSERIFORMES', 'NGỖNG', 'ORD_003', 'Anatidae', 'Vịt', 'FAM_018', 'Anas', NULL, 'GEN_0089', 'anasacuta', 'Anas acuta', 'Linnaeus 1758           ', 'Vịt mốc', 'SPA_03403', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3383, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'ANSERIFORMES', 'NGỖNG', 'ORD_003', 'Anatidae', 'Vịt', 'FAM_018', 'Anas', NULL, 'GEN_0089', 'anascrecca', 'Anas crecca', 'Linnaeus, 1758            ', 'Mòng két', 'SPA_03404', 'Con đực: Bộ lông mùa hè. Một dải lục ánh kim loại viền trắng kéo dài từ mắt đến gáy và trên cổ. Phần còn lại của đầu và cổ nâu đen thẫm, cằm và trước mắt hơi nhạt hơn. Dưới cổ, trên lưng, vai và sườn trắng có vân đen ở ngực các vằn lớn hơn và giữa ngực là các điểm đen. Lưng dưới nâu, mép lông có vằn. Hông nâu, mỗi lông có viền màu nhạt hơn. Mặt bụng trắng.\nDưới đuôi đen, hai bên nâu đỏ. Bao cánh nâu xám nhạt, các lông bao cánh lớn có viền trắng. Gương cánh lục có ánh đồng, phía trước viền hung nhạt, phía sau viền bằng hai đường đen và trắng. Lông cánh tam cấp nâu bạc. Bộ lông mùa đông. Gần giống bộ lông chim cái nhưng gương có ánh xanh đẹp hơn.\nCon cái: Đầu nâu đen. Mặt lưng nâu thẫm, các lông đều viền hung nhạt. Trước mắt, hông và cổ trắng phớt hung gỉ sắt, có điểm nâu ở giữa lông. Sườn và ngực trắng hung hay hung nâu, có điểm nâu thẫm. Mắt nâu, mỏ chim đực đen, mỏ chim cái hơi vàng hay vàng lục. Chân xám vàng, đôi khi phớt xanh. ', NULL, 'Việt Nam mòng két có ở khắp vùng đồng bằng Bắc bộ nhất là ở các cửa sông và ở dải đồng bằng ven bờ biển ở Trung bộ đến Thừa Thiên; thỉnh thoảng gặp cả ở các vực nước ở vùng trung du và vùng núi. châu Âu và Bắc châu Á. Mùa đông mòng két di cư về phia Nam ở khắp vùng bờ biển châu Âu từ Nauy đến Hắc Hải, Tây Phi, lưu vực sông Nin, Hồng hải, Irắc, Iran, Ấn Độ, Miến Điện, Thái Lan, Bắc Đông Dương, Nam Trung Quốc, Triều Tiên, Nhật Bản và Philipin.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3384, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'ANSERIFORMES', 'NGỖNG', 'ORD_003', 'Anatidae', 'Vịt', 'FAM_018', 'Anas', NULL, 'GEN_0089', 'anaspenelope', 'Anas penelope', 'Linnaeus, 1758            ', 'Vịt đầu vàng', 'SPA_03405', '48cm. Là loài vịt cỡ trung bình, lùn và mập với mỏ nhỏ màu xám, trán dốc, đầu tròn và đuôi nhọn. Sống thành đàn và thường thấy chúng ăn cỏ ở trên bờ. Đứng thẳng dưới nước. Vào đầu mùa đông, các đàn vịt đầu vàng quần tụ khá đa dạng. Chim trống: Trán có màu xanh nhạt và khi đứng yên thấy có một đường trắng nằm ngang ở hai bên hông. Chim mái và chim chưa trưởng thành: Có màu nâu hơi đỏ sẫm. Chim trống ngoài mùa sinh sản: Giống như chim cái và cũng có đường trắng ở hai bên hông. Tiếng kêu: Chim trống phát ra những tiếng huýt vang xa đặc trưng.', NULL, 'Ba Vì', NULL, NULL, NULL, NULL, NULL, NULL, 'Đỗ Tước và Đặng Thanh Long (2013). Chuyên đề điều tra đa dạng động vật rừng trên địa bàn thành phố Hà Nội. Chi Cục Kiểm lâm Hà Nội'),
(3385, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'ANSERIFORMES', 'NGỖNG', 'ORD_003', 'Anatidae', 'Vịt', 'FAM_018', 'Anas', NULL, 'GEN_0089', 'anaspoecilorhyncha', 'Anas poecilorhycha', '(Forster, 1781)', 'Vịt trời', 'SPA_03407', '60cm. Là loài vịt lớn, vằn nâu ở khắp thân với đầu và cổ màu nhạt hơn thân khá tương phản; gáy và đỉnh đầu màu nâu tối; mỏ màu đen với chóp mỏ màu vàng. Lông tam cấp màu trắng dễ thấy khi chim đứng yên. Chim trống và chim cái có màu giống nhau nhưng chim cái và chim chưa trưởng thành có màu xám xịt hơn. Các vùng đầm lầy, đồng cỏ ngập nước, hồ và kênh rạch. Làm tổ ở bụi rậm ven bờ hoặc trên các đám cỏ cây thủy sinh.', NULL, 'Bắc Bộ, Trung Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3386, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'ANSERIFORMES', 'NGỖNG', 'ORD_003', 'Anatidae', 'Vịt', 'FAM_018', 'Anas', NULL, 'GEN_0089', 'anasquerquedula', 'Anas querquedula', 'Linnaeus, 1758', 'Mồng két mày trắng ', 'SPA_03408', ' 37cm. Là loài vịt nhỏ, mảnh dẻ. Đỉnh đầu hơi bằng. Khi bơi, chìm xuống mặt nước sâu hơn so với mồng két, đuôi và cánh dang ra tạo thành một góc. Chim trống: Có vạch rộng màu trắng trên đầu và khi bay thấy phần trước cánh có màu xám bạc. Chim mái, chim đực ngoài mùa sinh sản và chim non: Giống như Mồng két cái nhưng có họa tiết trên đầu dễ phân biệt hơn; vạch qua mắt màu sẫm, vạch trên mắt rõ ràng, cổ họng trắng hoàn toàn và thường có một đốm màu xanh nhạt nổi bật ở gốc mỏ. Vùng đầm lầy và các hồ nước, vùng ven biển.', NULL, 'Bắc Bộ, Bắc Trung Bộ, Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, 'LC', NULL, 'Vietnam Bird Guide'),
(3387, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'ANSERIFORMES', 'NGỖNG', 'ORD_003', 'Anatidae', 'Vịt', 'FAM_018', 'Aythya', NULL, 'GEN_0193', 'aythyabaeri', 'Aythya baeri', '(Radde, 1863)', 'Vịt đầu đen', 'SPA_03409', 'Mùa hè: Con đực trưởng thành có màu đen ánh lục ở đầu và cổ. Chim cái có màu nâu đen ở đầu và cổ. Mắt trắng hoặc vàng nhạt, mỏ màu xám chì, gốc chóp mỏ nâu thẫm hoặc đen. Chân màu xám vàng hoặc màu chì. Vùng sống thích hợp là các vùng ngập triều, các hồ trong đất liền và các đầm lầy. Làm tổ trong các bụi cỏ thuỷ sinh ven bờ.', NULL, 'Trong nước: Đồng bằng Bắc Bộ, Hải Dương, Hà Tây (hồ Suối Hai) Thế giới: Lưu vực sông A Mua, Nhật Bản, Nam Trung Quốc, Lào, Cămpuchia, Ấn Độ, Mianma.', NULL, NULL, 'Là nguồn gen quý hiếm có giá trị khoa học cao', 'DD', 'EN', NULL, 'Agriviet'),
(3388, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'ANSERIFORMES', 'NGỖNG', 'ORD_003', 'Anatidae', 'Vịt', 'FAM_018', 'Aythya', NULL, 'GEN_0193', 'aythyamarila', 'Aythya marila', '(Linnaeus, 1761)', 'Vịt biển', 'SPA_03410', '45cm. Là loài vịt cỡ trung bình, đầu tròn, mỏ to và rộng. Thường sống ở biển vào mùa đông. Lặn liên tục. Mắt vàng. Chim trống: Dễ phân biệt; trước và sau cơ thể màu đen, lưng màu xám và hai bên màu trắng. Chim mái: Có màu nâu nhạt với một mảng trắng sáng xung quanh gốc mỏ vào mùa đông (rõ hơn nhiều so với Vịt mào); lông bao tai có màu trắng nhạt (ngoài mùa sinh sản). Vịt chưa trưởng thành: Giống chim cái nhưng thường không có màu trắng ở mặt.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/group/greater-scaup-444'),
(3389, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'ANSERIFORMES', 'NGỖNG', 'ORD_003', 'Anatidae', 'Vịt', 'FAM_018', 'Cairina', NULL, 'GEN_0275', 'cairinascutulata', 'Cairina scutulata', '(Müller , 1842)', 'Ngan cánh trắng', 'SPA_03411', 'Chiều dài thân: 66 - 81cm. Đây là loài chim sống ở vùng rừng, nhìn chung bộ lông có màu tối. Lông bao cánh nhỡ và nhỏ trắng, khi bay nhìn thấy rõ màu trắng của lông bao cánh tương phản với màu lông của các phần còn lại trên cánh. Đầu và trên cổ trắng nhạt. Mỏ vàng nhạt. Con cái nhỏ hơn con đực, con non có màu nâu nhiều hơn. Ngan cánh trắng sống ở vùng đất ngập nước tự nhiên (nước tù hay có chảy chậm), hay nhân tạo, nằm bên trong hay gần các vùng rừng thường xanh, rừng cây họ dầu, rừng ngập nước ngọt, phụ thuộc nơi làm tổ và ngủ của chim. Thường làm tổ trong hốc cây. Nơi ở thích hợp nhất là vùng đất ngập nước trũng (dưới 200m), có thể gặp tới độ cao 1.500m., đặc biệt là ở vùng cao nguyên nơi có các con suối chảy chậm hay hồ và có nước quanh năm. Mặc dầu có đời sống định cư, song một số con lại di chuyển ở khoảng cách không xa vào mùa khô khi mực nước bị cạn kiệt . Thường gặp đi lẽ hay đôi, và kiếm ăn về đêm. Tại suối Đắk Đoa (Đắk Mil, Đắk Lắk), năm 1998, lúc sáng sớm, gặp hai con kiếm ăn ở vùng suối cạn, nhiều đá, nước chảy chậm, hai bên là rừng già cây họ dầu và tre, không có các hoạt động của con người. Trước đó, vào sáng sớm, gặp chúng bay khỏi nơi đó. Năm 1993, gặp hai con Ngan cánh trắng bay về khu rừng ven hồ vào lúc sáng sớm, chứng tỏ chúng kiếm ăn trong đêm tại khu vực ruộng lúa ở ngay bên ngoài bờ hồ Kẻ Gỗ.', NULL, 'Trung bộ và Nam bộ. Ấn Độ, Mianma, Thái Lan, Lào, Cămpuchia, Malaixia và Inđônêxia.', NULL, NULL, 'Loài hiếm, bị đe doạ tuyệt chủng trên thế giới, trong khu vực và ở nước ta.', 'CR', NULL, NULL, 'vncreatures.net'),
(3390, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'ANSERIFORMES', 'NGỖNG', 'ORD_003', 'Anatidae', 'Vịt', 'FAM_018', 'Dendrocygna', NULL, 'GEN_0560', 'dendrocygnajavanica', 'Dendrocygna javanica', '(Horsfield, 1821)            ', 'Le nâu', 'SPA_03412', 'Là loài vịt nhỏ, chân dài, hình dáng giống ngỗng. Chim trống và chim cái giống nhau. Phần dưới cơ thể màu hung đỏ, đầu và gáy màu nâu sẫm. Chim non màu nhạt hơn. Khi bay khá chậm thì đầu thấp hơn thân, chân để dọc theo đuôi ngắn, cánh rộng và bầu. Tiếng kêu: Tiếng huýt du dương thường phát ra khi đang bay. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3391, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'ANSERIFORMES', 'NGỖNG', 'ORD_003', 'Anatidae', 'Vịt', 'FAM_018', 'Nettapus', NULL, 'GEN_1315', 'nettapuscoromandelianus', 'Nettapus coromandelianus', 'Gmelin, 1789', 'Le khoang cổ', 'SPA_03413', 'Chiều dài thân: 33 - 38 cm. Con đực có đầu, cổ và khoang cổ màu trắng, chóp đỉnh đầu đen. Trên lưng và cánh màu xanh cánh vịt. Bao dưới đuôi đen nhạt. Khi bay nhìn thấy dưới cánh có dải trắng. Con cái nhìn chung bộ lông màu nâu nhạt, có dải đen hẹp ngang mắt Sống định cư, lên tới đai độ cao 800m (79), có thể di chuyển nhưng chỉ trong phạm vi khu vực phân bố (ví dụ ở Trung trung bộ và Nam bộ, hay vào mùa đông gặp ở Xingapo). Sinh cảnh vùng cư trú là đầm, hồ và các khu vực ngập nước ngọt khác. Tại Vườn quốc gia Cát Tiên (Đồng Nai) đã quan sát thấy Le khoang cổ sống theo đàn nhỏ ở khu vực dọc suối chảy qua vùng rừng thưa cây họ Dầu Dipterocarpaceae và họ Cỏ Poaceae, thường đậu trên cây gỗ lớn, trụi lá (62), ở Khu bảo tồn thiên nhiên Đầm Dơi (Cà Mau), gặp 3 - 4 cá thể sau khi khu rừng cây gỗ lớn gần như đã bị huỷ hoại, còn ở Sân chim Bạc Liêu chỉ gặp một đôi tại khu ao ở trung tâm vườn (88). Thời gian sinh sản trong khoảng tháng 6 - 8, tổ làm trong hốc cây hay bên ngoài, độ cao tổ so với mặt đất từ 2 - 21m, đẻ từ 8 - 14 trứng, kích thước trứng: 43,1 x 32,9 mm (79).', NULL, 'Trong nước: Từ Bắc vào Nam (trừ Tây Bắc và Bắc Trung Bộ): Cà Mau, Đồng Tháp, Bạc Liêu, An Giang, Đồng Nai và Đắk Lắk. Thế giới: Ấn Độ đến Nam Trung Quốc và Tây Bắc Inđônêxia.', NULL, NULL, 'Nguồn gen quý đang bị suy giảm mạnh và là đối tượng phục vụ du lịch sinh thái, giải trí, được nhiều người ưa thích.', 'EN', NULL, NULL, 'VnCreature'),
(3392, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'ANSERIFORMES', 'NGỖNG', 'ORD_003', 'Anatidae', 'Vịt', 'FAM_018', 'Spatula', NULL, 'GEN_1838', 'spatulaquerquedula', 'Spatula querquedula', '(Linnaeus, 1758)', 'Mòng két mày trắng', 'SPA_03414', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3393, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'APODIFORMES', 'YẾN', 'ORD_005', 'Apodidae', 'Yến', 'FAM_028', 'Aerodramus', NULL, 'GEN_0042', 'aerodramusfuciphagus', 'Aerodramus fuciphagus', 'Oustalet, 1878', 'Yến hông xám', 'SPA_03415', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3394, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'APODIFORMES', 'YẾN', 'ORD_005', 'Apodidae', 'Yến', 'FAM_028', 'Aerodramus', NULL, 'GEN_0042', 'aerodramusgermani', 'Aerodramus germani', '(Oustalet, 1876)', 'Yến hông xám', 'SPA_03416', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3395, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'APODIFORMES', 'YẾN', 'ORD_005', 'Apodidae', 'Yến', 'FAM_028', 'Apus', NULL, 'GEN_0138', 'apusaffinis', 'Apus affinis', '(JE Gray, 1830)', 'Yến cằm trắng', 'SPA_03417', '15cm (sải cánh 35cm). Nhỏ hơn Yến hông trắng và đuôi hình vuông khi xòe ra. sống: Thường làm tổ tập đoàn xung quanh các mái nhà ngói trong thành phố.', NULL, ' Nam Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3396, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'APODIFORMES', 'YẾN', 'ORD_005', 'Apodidae', 'Yến', 'FAM_028', 'Apus', NULL, 'GEN_0138', 'apusnipalensis', 'Apus nipalensis', '(JE Gray, 1830)', 'Yến cằm trắng', 'SPA_03418', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3397, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'APODIFORMES', 'YẾN', 'ORD_005', 'Apodidae', 'Yến', 'FAM_028', 'Apus', NULL, 'GEN_0138', 'apuspacificus', 'Apus pacificus', 'Latham, 1802            ', 'Yến hông trắng', 'SPA_03419', '19cm. Khác biệt với Yến cằm trắng bởi cánh dài, đuôi chẻ đôi sâu, bay thong thả hơn.  sống: Bay lượn kiếm ăn trên các vùng đất trống trải và rừng lên tới độ cao trên khoảng 2.000 mét. Làm tổ tập đoàn từ tháng 4-7', NULL, 'Khắp các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3398, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'APODIFORMES', 'YẾN', 'ORD_005', 'Apodidae', 'Yến', 'FAM_028', 'Collocalia', NULL, 'GEN_0450', 'collocaliabrevirostris', 'Collocalia brevirostris', 'Hume, 1873.', 'Yến núi', 'SPA_03420', 'Mô tả:\nĐỉnh đầu, cánh, đuôi đen đậm. Lưng nâu đen ở bụng màu nhạt hơn lưng. Có băng sáng rộng ở hông, dọc thân lông tối. Lông tơ ở lưng có chóp trắng. Đuôi trẻ khá sâu, có một hàng lông ở giò ngoài.\nSinh học:\nLàm tổ quanh năm (trong trường hợp bị mất tổ). Tổ gồm nước bọt và lông cơ thể màu đen, không ăn được. Đẻ vào tháng 3 - 10. Tỷ lệ đẻ sinh thái 61% (1, 2 con/tổ). Thức ăn chủ yếu là côn trùng (99%) có kích thước nhỏ. Kẻ thù chủ yếu là con người.\nNơi sống và sinh thái: Sống lẫn lộn với chim yến hàng. Tổ làm trên các đảo và các hang đá ven biển.', NULL, 'Việt Nam: Bình Định (bán đảo Phước Mai 4 đôi), Khánh Hòa (hòn Chà Là, hòn Nội, hòn Ngoại: 50 - 60 đôi).\nThế giới: Phía nam Trung Quốc, vịnh Thái Lan.', NULL, NULL, 'Tổ dùng làm thuốc chữa hen suyễn.', 'R', NULL, NULL, 'vncreatures.net'),
(3399, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'APODIFORMES', 'YẾN', 'ORD_005', 'Apodidae', 'Yến', 'FAM_028', 'Collocalia', NULL, 'GEN_0450', 'collocaliafuciphaga', 'Collocalia fuciphaga', 'Oustulet, 1871', 'Yến hông xám', 'SPA_03421', 'Đầu cánh và đuối đen đậm. Lưng nâu đen, mặt bụng màu nhạt hơn lưng. Có một băng sáng rộng ở hông, thân lông tối ở lưng có lông tơ màu trắng. Đôi khi có một vài lông nhỏ ở mặt trong giò. Mắt đen, mỏ đen. Tổ bằng nước bọt màu trắng, ăn được. Làm tổ theo đàn trong các hang đá ven biển, từ tháng 12 đến tháng 6 năm sau, đẻ trứng vào tháng 3 - 7. Đẻ 1 - 2 trứng. Thức ăn chủ yếu là côn trùng có kích thước nhỏ bay trong không khí. Sống và làm tổ ở các đảo hoặc các dải ven biển. Sống tập đoàn tạo thành đàn lớn có khi tới hàng vạn tổ. Kiếm ăn trên đất liền. Kẻ thù chủ yếu là con ngườ i(khai thác tổ).', NULL, 'Việt Nam: Làm tổ từ khoảng 180 vĩ bắc trở vào Quảng Bình (hòn Vĩnh Sơn, hòn Chùa, hòn La), Đà Nẵng (Cù Lao Chàm), Quảng Ngãi (hòn Đồi Mồi, Hòn Nối, hòn Ngoại,....), Côn Đảo, Phú Quốc, Nam Du, Thổ Chu. Thế giới: Vịnh Thái Lan, Tây nam Bocnêo, Palawan.', NULL, NULL, 'Tổ có giá trị xuất khẩu cao. Có giá trị kinh tế và khoa học.', NULL, NULL, NULL, 'VnCreature'),
(3400, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'APODIFORMES', 'YẾN', 'ORD_005', 'Apodidae', 'Yến', 'FAM_028', 'Collocalia', NULL, 'GEN_0450', 'collocaliagermani', 'Collocalia germani', '(Oustalet, 1876)', 'Yến hông xám', 'SPA_03422', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3401, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'APODIFORMES', 'YẾN', 'ORD_005', 'Apodidae', 'Yến', 'FAM_028', 'Cypsiurus', NULL, 'GEN_0536', 'cypsiurusbalasiensis', 'Cypsiurus balasiensis', '(Gray,JE, 1829)            ', 'Yến cọ', 'SPA_03423', 'Chim trưởng thành:\n\nMặt lưng nâu đen nhạt, cánh và đuôi nâu hơi có ánh thép. Mặt bụng nâu thẫm, cằm và họng hơi nhạt hơn.\n\nMắt nâu thẫm. Mỏ và chân đen.\n\nKích thước:\n\nCánh: 111 - 126; đuôi: 61 - 66; giò: 8; mỏ: 4 - 5 mm. ', NULL, 'Việt Nam, yến cọ khá phổ biến, hầu hết các vùng núi và trung du. Chúng thường làm tổ trên các lá cau, lá cọ. Vùng phân bố của yến cọ bao gồm Axam, Miến Điện, Thái Lan, Nam Trung Quốc, Đông Dương, Mã Lai, Xumatra và Java.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(3402, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'APODIFORMES', 'YẾN', 'ORD_005', 'Apodidae', 'Yến', 'FAM_028', 'Cypsiurus', NULL, 'GEN_0536', 'cypsiurusparvus', 'Cypsiurus parvus', '(Lichtenstein, 1823)', 'Yến cọ', 'SPA_03424', 'Yến cọ châu Phi là loài chim sinh sản cố định phổ biến tại vùng nhiệt đới châu Phi. Tổ làm bằng lông tơ và lông vũ được dính vào mặt dưới lá cọ bằng nước bọt. Chim mái thường đẻ hai trứng. Loài yến này là loài chim bay nhanh của những vùng đồng thưa, với cuộc sống gắn liền với cọ dầu', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Y%E1%BA%BFn_c%E1%BB%8D_ch%C3%A2u_Phi'),
(3403, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'APODIFORMES', 'YẾN', 'ORD_005', 'Apodidae', 'Yến', 'FAM_028', 'Hirundapus', NULL, 'GEN_0887', 'hirundapuscaudacutus', 'Hirundapus caudacuta', '(Latham, 1802)', 'Yến đuôi cứng hông trắng', 'SPA_03425', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3404, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'APODIFORMES', 'YẾN', 'ORD_005', 'Apodidae', 'Yến', 'FAM_028', 'Hirundapus', NULL, 'GEN_0887', 'hirundapuscochinchinensis', 'Hirundapus  cochinchinensis', '(Oustalet, 1878)', 'Yến đuôi cứng bụng trắng', 'SPA_03426', 'Chim trưởng thành:\nMột điểm hình tam giác trước mắt và các lông quanh mắt đen. Đỉnh đầu, hai bên đầu, cổ, hai bên hông, trên đuôi và đuôi đen có ánh lục và xanh. Lưng nâu thẫm, ở giữa màu nhạt hơn, hai bên thẫm hơn và lẫn dần với màu đen ở xung quanh. Lông cánh đen có ánh xanh, phiến ngoài của lông cánh tam cấp có ánh lục phần lớn phiến lông trong trắng.\nCằm và họng xám. Dưới đuôi trắng. Hai bên sườn có điểm trắng. Phần còn lại của mặt bụng nâu thẫm. Lông đuôi tròn, mút thân lông lồi ra ngoài thành gai.\nMắt nâu thẫm. Mỏ đen. Chân đen hay xám phớt đỏ.\nKích thước:\nCánh: 179 - 193; đuôi: 48 - 49; giò: 16; mỏ: 8 mm. ', NULL, 'loài này có ở Nam Trung bộ và Nam bộ. Loài yến này phân bố ở Miến Điện, Nam Đông Dương, Mã Lai và Xumatra.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3405, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'APODIFORMES', 'YẾN', 'ORD_005', 'Apodidae', 'Yến', 'FAM_028', 'Hirundapus', NULL, 'GEN_0887', 'hirundapusgiganteus', 'Hirundapus giganteus', '(Temminck, 1825)', 'Yến đuôi cứng lớn', 'SPA_03427', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3406, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'APODIFORMES', 'YẾN', 'ORD_005', 'Hemiprocnidae', 'Yến Mào', 'FAM_177', 'Hemiprocne', NULL, 'GEN_0855', 'hemiprocnecoronata', 'Hemiprocne coronata', '(Tickell, 1833)', 'Yến mào', 'SPA_03428', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3407, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CAPRIMULGIFORMES', 'CÚ MUỖI', 'ORD_012', 'Podargidae', 'Cú Muỗi Mỏ Quặp', 'FAM_298', 'Batrachostomus', NULL, 'GEN_0215', 'batrachostomushodgsoni', 'Batrachostomus hodgsoni', '(Gray, 1859).', 'Cú muỗi mỏ quặp', 'SPA_03429', 'Chim đực trưởng thành:\nMặt lưng hung nâu thẫm có vằn hẹp màu đen nhạt. Đỉnh đầu có vạch và vằn dày nâu đen; gáy hung nâu hơi nhạt tạo thành vòng cổ không rõ. Trước mắt và dải lông mày hung nâu nhạt lẫn đen. Lưng và bao cánh có những vệt đen nhỏ, các vệt ở cánh có viền hung nâu nhạt. Lông vai và các lông cánh thứ cấp trong cùng có vệt trắng hơi phớt hung lớn có lấm tấm nâu. Lông cánh sơ cấp nâu có vằn ngang hung nâu nhạt ở phiến lông ngoài, mút lông có lằn vằn. Lông đuôi có vằn lượn sóng đen, nâu và hung nâu không đều. Cằm và họng hung nâu lẫn đen nhạt. Phần còn lại của mặt bụng lấm tấm và lằn vằn hung nâu, đen và trắng nhạt, ở ngực có vằn ngang đen và hung nâu khá rõ.\nChim cái:\nBộ lông hoàn toàn màu hung nâu, mặt lưng hơi thẫm và tươi mặt bụng hơi nhạt. Trước mắt và dải lông trên mắt màu hung nâu lẫn trắng nhạt. Một vòng ở gáy khá rõ màu trắng có vằn đen. Lông vai có chấm trắng và viền đen ở mép ngoài. Lông đuôi hung nâu thẫm với hai giải kép, mảnh màu đen nhạt. Ngang qua ngực có một dải lông trắng viền đen, một dải thứ hai chạy qua phần dưới ngực và một dải khác từ ngực đến sườn.Mắt nâu nhạt hay thẫm. Mỏ nâu hồng nhạt, mút mỏ và sống, mỏ hơi thẫm hơn. Chân nâu hồng.\nKích thước:\nCánh: 280 - 317; đuôi: 205 - 225; giò: 21 - 22; mỏ: 10 - 11mm.', NULL, 'Cú muỗi mỏ quặp phân bố ở Axam, Miến Điện, Đông nam Thái Lan, Nam Đông Dương và Mã Lai.\nViệt Nam đã bắt được Loài này ở Kontum (Đắc tô), Biên Hòa, Thủ Dầu Một và khá phổ biến ở rừng Tây Ninh. Là loài duy nhất thuộc họ Cú muỗi mỏ quặp Podargidae phân bố ở Việt nam', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3408, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CAPRIMULGIFORMES', 'CÚ MUỖI', 'ORD_012', 'Podargidae', 'Cú Muỗi Mỏ Quặp', 'FAM_298', 'Batrachostomus', NULL, 'GEN_0215', 'batrachostomusjavensis', 'Batrachostomus javensis', '(Horsfield, 1821)', 'Cú muỗi Java mỏ quặp', 'SPA_03430', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3409, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Burhinidae', 'Bu Rin', 'FAM_054', 'Burhinus', NULL, 'GEN_0265', 'burhinusoedicnemus', 'Burhinus oedicnemus', '(Linnaeus, 1758)', 'Bu rin', 'SPA_03431', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3410, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Charadriidae', 'Choi Choi', 'FAM_075', 'Charadrius', NULL, 'GEN_0365', 'charadriusalexandrinus', 'Charadrius alexandrinus', 'Linnaeus, 1758', 'Choi choi khoang cổ', 'SPA_03432', 'Loài chim biển nhỏ nặng khoảng 40 g khi trưởng thành. Cả chim đực và chim cái đều có mỏ đen và chân sẫm màu, tuy nhiên chim trưởng thành có bộ lông lưỡng hình. Trong mùa sinh sản, con đực có vạch ngang đầu màu đen, hai dải ngực sẫm màu không hoàn chỉnh ở mỗi bên ngực, tấm che tai màu đen, gáy và vương miện màu đỏ (mặc dù có một số khác biệt giữa các quần thể sinh sản), trong khi con cái thì có. nhạt màu hơn ở những khu vực này, không có vết sẫm màu. [14] [15] Vào đầu mùa sinh sản , rất dễ phân biệt giữa con đực và con cái vì các hình trang trí rất rõ ràng, nhưng khi mùa sinh sản diễn ra, sự khác biệt giữa hai giới giảm dần. Hơn nữa, con đực có tarsi dài hơn và lông bên sườn dài hơn con cái', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3411, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Charadriidae', 'Choi Choi', 'FAM_075', 'Charadrius', NULL, 'GEN_0365', 'charadriusdubius', 'Charadrius dubius', 'Scopoli, 1786.', 'Choi choi nhỏ', 'SPA_03433', '16cm. Khác với các loài choi choi tương tự khác bởi khi bay không thấy vằn trắng ở cánh. Bộ lông có vòng cổ màu trắng, đây là đặc điểm dễ phân biệt Choi choi nhỏ với Choi choi lưng hung. Thời kì sinh sản: Vòng cổ quanh họng đen hoàn toàn; mặt màu đen với mảng trắng ở giữa trán và một đường trắng phía trên vùng lông đen ở đỉnh đầu; mỏ thường có màu đen; chân có màu hồng nhạt và vành mắt có màu vàng sang. Ngoài mùa sinh sản: Những vùng màu đen được thay bằng màu nâu và phần ngực có màu nâu nhạt. Chim non: Giống chim ở ngoài mùa sinh sản nhưng có nhiều vạch màu vàng sẫm ở phía lưng, đầu có nhiều đốm mờ, giò vàng nhạt. Tiếng kêu: Phát ra khi bay tiếng orpi-y-uõ.', NULL, 'Tất cả các vùng trong cả nước. Độ cao phân bố lên đến gần 1.500 mét', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3412, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Charadriidae', 'Choi Choi', 'FAM_075', 'Charadrius', NULL, 'GEN_0365', 'charadriusleschenaultii', 'Charadrius leschenaultii', '(Lesson, 1826).', 'Choi choi lớn', 'SPA_03434', '22cm. Choi choi lớn khác với các loài choi choi khác là không có vòng lông cổ màu trắng. Chỉ khác với Choi choi mo cổ là size lớn hơn và cao hơn, có mỏ màu đen dài hơn và nặng nền hơn (chóp mỏ không rộng hơn), và giò màu vàng nhạt, dài hơn. Trong mùa sinh sản : Ngực màu nâu hơn và không có đường vạch đen chia phần côn với phần màu trắng ở cổ phi tiêu. Ngoài ra mùa sinh sản : Không có các loại ngựa màu đen và màu nâu; tuy nhiên Choi choi mom cổ trông thon thả hơn, mỏ ngắn hơn, giò đậm màu hơn và ở hầu hết thời kỳ đều có phần lông màu trắng ở cổ bể rõ ràng hơn. Choi choi lớn và Choi choi mẹ thường sống cùng nhau, nên khó phân biệt. Khi bay, cả hai loài đều có một màu trắng ở cánh. Tiếng kêu: Rung lên như tiếng kêu nhỏ của trẻ sơ sinh.  Bãi bồi bồi hoặc bãi cát ngập triều ven biển.', NULL, 'Các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3413, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Charadriidae', 'Choi Choi', 'FAM_075', 'Charadrius', NULL, 'GEN_0365', 'charadriusmongolus', 'Charadrius mongolus', '(Pallas, 1776)', 'Choi choi mông cổ', 'SPA_03435', '20cm. Xem mô tả Choi choi lớn. Tiếng kêu: Từng tiếng hai hoặc ba âm một.', NULL, 'Khắp các vùng trong cả nước.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3414, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Charadriidae', 'Choi Choi', 'FAM_075', 'Charadrius', NULL, 'GEN_0365', 'charadriusplacidus', 'Charadrius placidus', 'Gray & Gray, 1863', 'Choi choi lớn', 'SPA_03436', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3415, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Charadriidae', 'Choi Choi', 'FAM_075', 'Charadrius', NULL, 'GEN_0365', 'charadriussp', 'Charadrius sp.', NULL, 'Choi choi?', 'SPA_03437', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3416, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Charadriidae', 'Choi Choi', 'FAM_075', 'Pluvialis', NULL, 'GEN_1593', 'pluvialisfulva', 'Pluvialis fulva', '(Gmelin, JF, 1789).', 'Choi choi vàng', 'SPA_03438', '23cm. Hình dáng nặng nề, đầu lớn. Màu lông phía lưng luôn có vằn. Trong mùa sinh sản phía lưng có vằn đen nổi bật, phía bụng và lưng phủ lên màu vàng óng ánh với một đường phân cách màu trắng. Mặt dưới bụng chim đang thay lông có màu loang lổ. Bay nhanh và nhẹ nhàng Các bãi ngập triều ở vùng cửa sông ven biển và ruộng lúa.  Loài di cư. Chỉ bay qua vùng Bắc Bộ. Tương đối phổ biến.', NULL, 'Các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3417, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Charadriidae', 'Choi Choi', 'FAM_075', 'Pluvialis', NULL, 'GEN_1593', 'pluvialissquatarola', 'Pluvialis squatarola', '(Linnaeus, 1758). ', 'Choi choi xám', 'SPA_03439', 'Mô tả: 30cm. Kích thước cơ sở lớn hơn Choi choi vàng và có màu xám hơn, đầu và mỏ lớn hơn. Choi choi xám ở thời kỳ sinh sản tương tự như Choi choi vàng nhưng phía sau màu bạc và dưới đuôi màu trắng. Phía bụng ở những con đang thay lông có màu loang lổ. Bay rất nhanh và linh hoạt. Tiếng kêu : Kéo dài đều đều orthi-u-iõ.', NULL, 'Phân vùng: Từ vùng Đông Bắc đến Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/group/black-bellied-plover-538'),
(3418, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Charadriidae', 'Choi Choi', 'FAM_075', 'Vanellus', NULL, 'GEN_2026', 'vanelluscinereus', 'Vanellus cinereus', '(Byth, 1842)            ', 'Te vàng', 'SPA_03440', '35cm. Ngoài mùa sinh sản: Ngực màu xám nâu nhạt và thường có dải lông vắt ngang màu đen nhạt. Khi bay, phần lông trắng rộng ở phía trong cánh tương phản với màu đen của lông cánh sơ cấp, và phần trước cánh nổi bật Sinh cảnh sống: Các vùng sình lầy, cánh đồng lúa và những nơi trồng trọt khác. Gặp lên tới độ cao khoảng 1.300 mét.', NULL, 'Các vùng trong cả nước trừ Tây Bắc và Bắc Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3419, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Charadriidae', 'Choi Choi', 'FAM_075', 'Vanellus', NULL, 'GEN_2026', 'vanellusduvaucelii', 'Vanellus duvaucelii', '(Lesson). ', 'Te cựa', 'SPA_03441', 'Đầu, mào đen và viền trắng ở phần sau. Mặt trên cổ nâu xám chuyển sang nâu nhạt ở lưng, hông, vai, các lông bao cánh trong và các lông cánh tam cấp. Trên đuôi trắng. Đuôi trắng ở phần gốc và đen ở phần chóp, các lông đuôi ngoài có mút trắng. Lông bao cánh sơ cấp và các lông cánh sơ cấp trắng, càng vào phía trong vệt trắng này càng lớn, đến các lông cánh thứ cấp ở giữa thì trắng hoàn toàn.\n\nCác lông bao cánh nhỏ ngoài đen, các lông bao cánh nhỡ và lớn trắng. Phần trên ngực trắng chuyển thành xám nâu ở phần dưới ngực và hai bên cổ. Bụng và dưới đuôi trắng. Bộ lông của chim non màu nhạt hơn. Mắt nâu thẫm. Mỏ đen. Chân nâu đen hay đen phớt đỏ. ', NULL, 'loài này có ở khắp các vùng núi và vùng trung du. Loài này phân bố ở Ấn Độ, Miến Điện, Thái Lan và Nam Trung Quốc.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3420, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Charadriidae', 'Choi Choi', 'FAM_075', 'Vanellus', NULL, 'GEN_2026', 'vanellusindicus', 'Vanellus indicus', '(Boddaert, 1783)            ', 'Te vặt', 'SPA_03442', '33cm. Chim trưởng thành có đầu, cổ và ngực trên màu đen tương phản với màu trắng ở phần dưới cơ thể và vệt trắng chạy từ dưới mắt xuống hai bên cổ. Mỏ đỏ, chóp mỏ màu đen; phần trên cơ thể màu nâu lục có ánh bóng màu tím và xanh lá cây. Giò màu vàng. Khi bay: Lông cánh sơ cấp đen; dải rộng ở lông sơ cấp, lông bao trên đuôi và dải cánh màu trắng; vằn ngang trên đuôi đen.', NULL, 'Bắc Trung Bộ (từ Thanh Hóa) đến Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3421, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Charadriidae', 'Choi Choi', 'FAM_075', 'Vanellus', NULL, 'GEN_2026', 'vanellusvanellus', 'Vanellus vanellus', '(Linnaeus, 1758)', 'Te mào', 'SPA_03443', '31cm. Đặc điểm phân biệt là đỉnh đầu có mào dài. Trong mùa sinh sản, màu lông ỏ cổ họng màu đen và phần trên cơ thể màu xanh ánh kim. Vùng xình lầy, và những nơi trồng trọt trống trải. Gặp lên độ cao khoảng 500 mét. Loài di cư. Thường sống thành từng đàn nhỏ', NULL, 'Vùng Đông Bắc, Bắc Trung Bộ ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3422, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Glareolidae', 'Dô Nách', 'FAM_160', 'Glareola', NULL, 'GEN_0761', 'glareolamaldivarum', 'Glareola maldivarum', 'Forster, 1795', 'Dô nách nâu (Óc Cau)', 'SPA_03444', 'Chim trưởng thành:\nMặt lưng nâu, lưng và hai bên cổ phớt hung. Trước mắt và một dải hẹp đen ở dưới mắt kẻo dài sang hai bên cổ rồi xuống dưới họng tạo thành một vòng hẹp. Hông và các lông trên đuôi ngắn, trắng. Các lông trên đuôi dài nâu viền màu nhạt. Đuôi đen với phần gốc trắng, Cằm, họng và vòng cổ hung nhạt. Ngực hung, chuyển thành hung sáng ở dưới ngực và thành trắng ở bụng và dưới đuôi. Lông bao cánh nhỏ, nhỡ và nách hung. Mắt nâu thẫm. Mỏ đen, mép mỏ đỏ nhạt. Chân đen nhạt.\nKích thước:\nCánh: 154 - 191; đuôi: 71 - 85; giò: 30 - 33; mỏ: 13 - 15m  ', NULL, 'loài này cỏ ở khắp các vùng đồng bằng cũng như ở vùng núi. Ấn Độ, Miến Điện, Trung Quốc, Đông nam Liên xô, Đông Dương và Mã Lai.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3423, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Jacanidae', 'Gà Lôi Nước', 'FAM_202', 'Hydrophasianus', NULL, 'GEN_0914', 'hydrophasianuschirurgus', 'Hydrophasianus chirurgus', '(Scopoli, 1786)', 'Gà lôi nước', 'SPA_03445', '30cm (đuôi những con đang ở thời kì sinh sản dài tới 25cm). Khi bay nhìn cánh hầu như chỉ có màu trắng. Trong mùa sinh sản: Rất dễ phân biệt. Ngoài mùa sinh sản: Phía lưng có màu nâu hơn, đuôi không dài và cổ có màu vàng lộ rõ.', NULL, 'Vùng Đông Bắc, vùng đất ngập nước Châu thổ sông Hồng, Trung Trung Bộ và Nam Bộ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/vietnamese-name/pheasant-tailed-jacana-547'),
(3424, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Jacanidae', 'Gà Lôi Nước', 'FAM_202', 'Metopidius', NULL, 'GEN_1214', 'metopidiusindicus', 'Metopidius indicus', '(Latham, 1790)', 'Gà lôi nước Ấn độ', 'SPA_03446', 'Gà lôi nước Ấn Độ là loài có kích thước trung bình trong nhóm gà lôi nước (khoảng 28 cm). Chim có bộ lông sặc sỡ với mày trắng, đầu, cổ và thân dưới màu xanh lá cây bóng, phần tím nổi bật trên lưng trên và cánh màu đồng. Chim trống và mái giống nhau. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnamwildlife'),
(3425, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Laridae', 'Mòng Bể', 'FAM_211', 'Chlidonias', NULL, 'GEN_0386', 'chlidoniashybrida', 'Chlidonias hybrida', '(Pallas, 1811).', 'Nhàn đen', 'SPA_03447', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3426, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Laridae', 'Mòng Bể', 'FAM_211', 'Chlidonias', NULL, 'GEN_0386', 'chlidoniasleucopterus', 'Chlidonias leucopterus', 'Temminck, 1815', 'Nhàn xám', 'SPA_03448', '23cm. Nhỏ hơn Nhàn đen, mỏ ngắn và dày. Thường lúc kiếm mồi có động tác vỗ cánh trên mặt nước rồi thọc mỏ xuống bắt mồi; rất ít khi lặn. Thường đậu trên các cọc và mỏm đá nhô lên từ mặt nước. Chim trong mùa sinh sản: Dễ phân biệt. Chim ở ngoài mùa sinh sản: Khó phân biệt với Nhàn đen, nhưng nhìn chung có vòng lông cổ màu trắng, lông bao tai tách biệt và chân màu đỏ tươi. Hông màu nhạt hơn (thường là trắng) đuôi vuông màu đen. Chim già hơn thường có hông màu xám nhạt hơn ở lưng, nhưng khi phân biệt phải thận trọng vì chim ngoài mùa sinh sản giống bộ lông mùa xuân, phía lưng đa số có màu giống nhau. Chim đang thay lông thường có màu trắng đen loang lổ. Chim non (mùa thu): Lưng màu nâu sẫm, tương phản với hông và vòng cổ màu trắng.', NULL, 'Đông Bắc (vùng ven biển đồng bằng sông Hồng), Trung Trung Bộ, Nam Trung Bộ và Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/bird/white-winged-tern-592'),
(3427, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Laridae', 'Mòng Bể', 'FAM_211', 'Gelochelidon', NULL, 'GEN_0748', 'gelochelidonnilotica', 'Gelochelidon nilotica', '(Gmelin, 1789)', 'Nhàn chân đen', 'SPA_03449', '35cm. Mỏ khỏe, màu đen và đuôi hơi xẻ. Bay bổ nhào, lướt trên mặt nước và mặt đất với mỏ chúc xuống; đôi khi lao đầu xuống. Ngoài mùa sinh sản, đầu màu trắng với một mảng màu đen nhạt phía sau mắt. Chim non phía trên cánh màu nâu sẫm dạng gợn sóng.', NULL, 'Đông Bắc (vùng ven biển đồng bằng sông Hồng), Bắc Trung Trung Bộ và Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/vietnamese-name/gull-billed-tern-212'),
(3428, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Laridae', 'Mòng Bể', 'FAM_211', 'Hydroprogne', NULL, 'GEN_0918', 'hydroprognecaspia', 'Hydroprogne caspia', '(Pallas, 1770)', 'Nhàn Caxpia', 'SPA_03450', '52cm. Kích thước lớn, mỏ đỏ, to, phía dưới lông cánh sơ cấp màu đen và đuôi chẻ nông. Bộ lông mịn, đẹp. Đầu đen có mào ngắn ở phía sau. Chim ngoài mùa sinh sản đầu không đen. Chim non có đốm màu nâu ở trên cơ thể.', NULL, 'Đông Bắc (vùng ven biển đồng bằng sông Hồng) và Nam Bộ (ven biển Cà Mau).', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/bird/caspian-tern-173'),
(3429, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Laridae', 'Mòng Bể', 'FAM_211', 'Larus', NULL, 'GEN_1031', 'larusbrunnicephalus', 'Larus brunnicephalus', 'Jerdon, 1840', 'Mòng bể đầu nâu', 'SPA_03451', 'Bộ lông mủa hè. Rất giống với loài trên nhưng màu nâu ở đầu nhạt hơn, mép dưới của phần nâu này tạo thành một vòng thẫm hơn ở phía trên cổ. Lông cánh sơ cấp 1 và 2 đen với điểm trắng nhỏ ở gốc và một điểm khác lớn hơn ở mút lông, lông thứ ba đen với một vạch trắng. Lông Cánh sơ cấp cuối cùng xám với mút lông đen. Mắt nâu đỏ hay vàng nâu. Mỏ, mí mắt, mép mỏ và Chân đỏ.', NULL, 'Loài này làm tổ ở đông Tây tạng; mùa đông di cư vê miền Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=46&loai=&ID=5368'),
(3430, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Laridae', 'Mòng Bể', 'FAM_211', 'Larus', NULL, 'GEN_1031', 'larusridibundus', 'Larus ridibundus', '(Linnaeus, 1766)', 'Mòng bể đầu đen', 'SPA_03452', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3431, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Laridae', 'Mòng Bể', 'FAM_211', 'Saundersilarus', NULL, 'GEN_1779', 'saundersilarussaundersi', 'Saundersilarus saundersi', 'Swinhoe, 1871', 'Mòng bể mỏ ngắn*', 'SPA_03453', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3432, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Laridae', 'Mòng Bể', 'FAM_211', 'Sterna', NULL, 'GEN_1861', 'sternahirundo', 'Sterna hirundo', 'Linnaeus, 1758', 'Nhàn', 'SPA_03454', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3433, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Recurvirostridae', 'Cà Kheo', 'FAM_317', 'Himantopus', NULL, 'GEN_0885', 'himantopushimantopus', 'Himantopus himantopus', '(Linnaeus, 1758). ', 'Cà kheo', 'SPA_03455', 'Giò màu hồng, đặc biệt dài, phần trên lưng, trên và dưới cánh có màu đen. Mỏ thẳng, dài, có màu đen. Sắc thái đầu có nhiều loại. Chim non màu nâu nhạt và nếu nhìn không rõ có thể nhầm với bộ lông mùa đông của loài choắt nhưng chiều dài và màu sắc của chân là những đặc điểm để phân biệt. ', NULL, 'Vùng Đông Bắc, Bắc Trung Bộ, Trung Bộ, Nam Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3434, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Rostratulidae', 'Nhát Hoa', 'FAM_324', 'Rostratula', NULL, 'GEN_1760', 'rostratulabenghalensis', 'Rostratula benghalensis', '(Linnaeus, 1758).', 'Nhát hoa', 'SPA_03456', '24cm. Dễ phân biệt. Đỉnh đầu có sọc màu nâu sẫm. Chim mái có nhiều đốm trắng ở mặt. Chim trống là bản sao nhạt màu của chim cái. Thường vẫy đuôi. Khó xua bay lên và khi bay lên từ mặt đất thì đôi chân thõng xuống như gà nước, trông có vẻ nặng nề. Khi bay để lộ các đốm trắng hình ô van ở hai bên đuôi. Đi kiếm ăn lúc hoàng hôn, tập hợp thành đàn nhỏ một vài con  Vùng đầm lầy có cây gỗ, và đồng ruộng.', NULL, 'Các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3435, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Actitis', NULL, 'GEN_0031', 'actitishypoleucos', 'Actitis hypoleucos', '(Linnaeus, 1758)', 'Choắt nhỏ', 'SPA_03457', '20cm. Đặc điểm dễ nhận biết là khi bay để lộ vằn rộng trên cánh màu trắng và bay thấp trên mặt nước. Cánh vỗ nhẹ xuống dưới (thường gần như chạm vào mặt nước) giữa các vòng lượn. Đầu và đuôi cử động liên tục. Đậu trên các vật thấp. Chim non về mùa thu có thể phân biệt với chim trưởng thành bởi nhiều vằn gợn sóng màu nâu sẫm trên lông bao cánh. Choắt nhỏ thường sống một mình hoặc từng đôi, nhưng thỉnh thoảng cũng có thể thấy nhiều con cùng kiếm ăn trong một vùng hẹp ở nơi có nhiều thức ăn. Tiếng kêu: Kêu ‘uy uy uy uy’ chói tai.', NULL, 'Đông Bắc (vùng ven biển Vịnh Bắc Bộ), Bắc Trung Bộ, Trung và Nam Trung Bộ, Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3436, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Arenaria', NULL, 'GEN_0152', 'arenariainterpres', 'Arenaria interpres', '(Linnaeus, 1758)', 'Rẽ khoang', 'SPA_03458', '22cm. Cánh có nhiều màu sắc xen kẽ nổi bật, giò ngắn màu da cam, chắc chắn. Trong mùa sinh sản phía sau có màu Nâu Nâu. Bộ lông ngoài mùa sinh sản và chim non có nhiều sọc và bồi đắp hơn. Kiếm ăn bằng cách sỏi đá', NULL, ' Đã tìm thấy ở vùng Đông Bắc, vùng cửa sông Hồng.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/english-name/ruddy-turnstone-253'),
(3437, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Calidris', NULL, 'GEN_0279', 'calidrisferruginea', 'Calidris ferruginea', 'Pontoppidan, 1763', 'Rẽ bụng nâu', 'SPA_03459', '21.5cm. Kích thước cơ thể trung bình, mỏ hơi dài và cong. Khi bay để lộ hông màu trắng (hình móng ngựa) và vằn cánh rõ nét. Bộ lông trong thời kì sinh sản màu hung đỏ giống Rẽ lưng nâu, ngoại trừ mỏ có hình dáng khác. Mùa đông chim cái màu đỏ xạm hơn và lông ở phía bụng có màu trắng hơn. Ngoài mùa sinh sản màu lông giống Rẽ trán trắng, nhưng phía bụng trắng hơn. Chim non có ngực màu nâu sẫm nhạt và phần trên cơ thể nhiều  vẩy hơn ở Rẽ trán trắng non. Tiếng kêu: ‘chi-rup’ nhẹ nhàng.', NULL, 'Đông Bắc (vùng ven biển đồng bằng sông Hồng), Bắc Trung Trung Bộ và Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/bird/curlew-sandpiper-568'),
(3438, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Gallinago', NULL, 'GEN_0730', 'gallinagogallinago', 'Gallinago gallinago', '(Linnaeus, 1758)            ', 'Rẽ giun ', 'SPA_03460', '27cm. Khác với các loài rẽ khác, Rẽ giun thường khi bay hiện rõ đường viền trắng chạy tới lông cánh thứ cấp và phía dưới cánh có màu hơi trắng. Khi đậu yên nhìn thấy rõ bộ lông có màu sáng hơn so với các loài rẽ khác với nhiều đường sọc nhô lên dọc theo lưng. Khi bị xua thì bay lên theo đường dích dắc và thường phát ra một tiếng kêu kèn kẹt khô khốc. Giống như tất cả các loài rẽ, Rẽ giun thường sống chui lủi cho đến khi bị xua mới bay lên. sống: Các vùng đầm lầy và cánh đồng lúa. Loài di cư', NULL, 'Khắp các vùng trong cả nước. Có thể phân bố lên độ cao khoảng 1.200 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3439, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Gallinago', NULL, 'GEN_0730', 'gallinagonemoricola', 'Gallinago nemoricola', 'Hodgson, 1836', 'Rẽ giun lớn', 'SPA_03461', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3440, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Gallinago', NULL, 'GEN_0730', 'gallinagostenura', 'Gallinago stenura', '(Bonaparte, 1830)            ', 'Rẽ giun Á châu', 'SPA_03462', '25cm. Khi đậu yên giống loài Rẽ giun thường, nhưng mỏ ngắn hơn và đuôi nhô hẳn lên trên, đôi khi cánh gập. Ở Rẽ giun á châu, lông mày màu nâu sẫm rộng hơn vằn mắt màu tối nằm ở gốc mỏ (không giống Rẽ giun thường). Không thấy đường viền trắng chạy tới lông cánh thứ cấp trong khi bay và có một đường sọc đậm ở dưới cánh. Bay lên từ mặt đất một cách dích dắc ở khoảng cách ngắn. Thường kêu ‘quác’ khi bay lên do bị xua đuổi như tiếng Rẽ giun thường. Trực tiếp nhận dạng thấy có mút đuôi rất nhỏ, lông đuôi có từ 26-28 cái.', NULL, 'Khắp các vùng trong cả nước.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/bird/pin-tailed-snipe-576'),
(3441, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Heterocelus', NULL, 'GEN_0875', 'heterocelusbrevipes', 'Heterocelus brevipes', '(Vieillot, 1816)', 'Choắt lùn đuôi xám', 'SPA_03463', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3442, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Limnodromus', NULL, 'GEN_1081', 'limnodromussemipalmatus', 'Limnodromus semipalmatus', '(Blyth, 1848)', 'Choắt chân màng lớn', 'SPA_03464', '33cm. Giống Choắt lông đuôi đen nhưng nhỏ hơn, luôn luôn có màu đen hơi cong lên, chóp má bành ra. Có chiều rộng ở hai bên hông. Khi bay để lộ lông cánh thứ màu trắng đục và dưới cánh màu trắng. Không giống với các loài choắt khác, Choắt chân ngủ lớn có phong cách Triết thức ăn rất nhanh. Trong mùa sinh sản : Đầu và kiếm có màu nâu đỏ. Ngoài mùa sinh sản : Có một vạch nổi màu xám nâu trên mắt. Chim non : Cổ và kiếm có màu nâu sẫm và đen mảnh.', NULL, 'Phân bố: Đông Bắc (vùng ven biển Vịnh Bắc Bộ), Bắc Trung Trung Bộ, Nam Trung Bộ và Nam Bộ (gặp đàn đông ở vùng bờ biển Cà Mau).', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/vietnamese-name/asian-dowitcher-572'),
(3443, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Limosa', NULL, 'GEN_1085', 'limosalimosa', 'Limosa limosa', '(Linnaeus, 1758) Brisson,1760', 'Choắt mỏ thẳng đuôi đen', 'SPA_03465', '38cm. Mỏ dài gần như thẳng. Khi bay để lộ vằn cánh màu trắng, đuôi có màu đen và trắng, và phần dưới cánh màu trắng. Trong mùa sinh sản: Chim trống có hai bên đầu, cổ và trước ngực màu đỏ nhạt, nhưng phần dưới cơ thể màu trắng, có nhiều đốm đen đậm. Ngoài mùa sinh sản: Khi ở tư thế đậu rất khó phân biệt với Choắt mỏ thẳng đuôi vằn nhưng có màu sẫm hơn, nâu hơn và mỏ thẳng hơn. Chim non: Cổ và ngực có màu nâu vàng nhạt.', NULL, 'Đông Bắc (vùng ven biển đồng bằng sông Hồng), Trung và Nam Trung Bộ, Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/bird/black-tailed-godwit-557'),
(3444, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Linnocryptes', NULL, 'GEN_1086', 'linnocryptesminima', 'Linnocryptes minima', NULL, 'Rẽ giun nhỏ', 'SPA_03466', '20cm. Kích thước nhỏ, chắc mập hơn và có mỏ ngắn hơn các loài rẽ khác (dài mỏ bằng chiều dài của đầu) và toàn bộ đỉnh đầu có sọc màu tối. Ngực và hai bên hông có vằn sọc. Đầu cử động lên xuống lúc kiếm ăn. Khi bay, có thể thấy nhiều sọc màu vàng ở trên lưng, đuôi màu nâu, nhọn gần giống hình chiếc nêm. Thường khi ở trên mặt đất thì khó xua bay lên, chui lủi vào nơi ẩn nấp rất nhanh. Không tiếng.', NULL, 'Vùng Tây Bắc và Nam Bộ. Phân bố lên độ cao khoảng 1.500 mét.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3445, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Numenius', NULL, 'GEN_1338', 'numeniusarquata', 'Numenius arquata', '(Linnaeus, 1758)', 'Choắt (rẽ) mỏ cong lớn', 'SPA_03467', 'Mô tả: 60cm. Kích thước cơ sở rất lớn, mỏ dài cong xuống. Màu lông không thay đổi trong năm. Khi bay để lộ đường viền cánh và phần đuôi màu trắng. Bay khỏe, rung nhịp. Cả đàn bay cao theo hình. Tiếng kêu : Một tiếng \`co-li\` du dương dễ nhận biết với âm độ vút cao.', NULL, 'Đông Bắc, Nam Trung Bộ và Nam Bộ. Khu cửa sông Hồng, đồng bằng ven biển Nha Trang, Phan Rang, Phan Thiết và bãi triều ở Cà Mau.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/bird/eurasian-curlew-556'),
(3446, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Numenius', NULL, 'GEN_1338', 'numeniusmadagascariensis', 'Numenius madagascariensis', '(Linnaeus, 1766)', 'Choắt (rẽ) mỏ cong hông nâu', 'SPA_03468', 'Mô tả: 61cm. Giống với Choắt mỏ cong lớn nhưng khi bay toàn bộ phần trên cơ thể có màu nâu (không có màu trắng ở phía lưng trên đuôi và đường viền cánh). Quan sát khi chim đậu thấy có màu sẫm hơn và nâu hơn so với Choắt mỏ cong lớn và phía lưng hoàn toàn màu nâu sẫm. Tiếng kêu: Giống như tiếng Choắt mỏ cong lớn nhưng ít du dương hơn.', NULL, 'Phân bố: Vùng Nam Trung Bộ và Nam Bộ. Tìm thấy ở vùng ven biển Bãi Bồi Đất Mũi Cà Mau (1999), vùng đất ngập nước ở Cam Ranh (1993), Gò Công và Bình Đại (2019)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/english-name/far-eastern-curlew-191'),
(3447, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Numenius', NULL, 'GEN_1338', 'numeniusphaeopus', 'Numenius phaeopus', '(Linnaeus, 1758).', 'Choắt (rẽ) mỏ cong bé', 'SPA_03469', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3448, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Phalaropus', NULL, 'GEN_1520', 'phalaropuslobatus', 'Phalaropus lobatus', '(Linnaeus, 1758)', 'Rẽ cổ đỏ', 'SPA_03470', ' 19cm. Dáng mảnh khảnh, mỏ đen, hình kim và thường bơi lội trên mặt nước. Khi bay lộ rõ vằn cánh rộng màu trắng và hông màu sẫm. Chim mái trong mùa sinh sản có bộ lông màu sáng hơn và cỡ lớn hơn con đực. Chim ngoài mùa sinh sản màu trắng và xám với vết đốm lớn màu sẫm trên mắt. Chim non có phần trên cơ thể màu nâu sẫm, ngón chân màu nâu sẫm vàng, ngực và cổ có màu nâu hồng. Thường tụ thành đàn bơi lội rất sôi động trên mặt nước, hay bơi thẳng ra biển. Bổ nhào rất nhanh và luôn lúc lắc đầu khi kiếm ăn trên nước. Bay duyên dáng như chim nhạn. Dạn người.  Bãi bồi ngập thủy triều ven biển, ao, ngoài biển xa. Loài di cư. Không phổ biến.', NULL, 'Gặp ở các vùng ven biển Nghĩa Hưng, Xuân Thủy tỉnh Nam Định. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3449, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Scolopax', NULL, 'GEN_1796', 'scolopaxrusticola', 'Scolopax rusticola', 'Linnaeus, 1758', 'Rẽ gà, Nhát bà', 'SPA_03471', ' 34cm. Kích thước lớn hơn Rẽ giun, lùn hơn, đầu hình tam giác, đỉnh đầu có vằn, cánh rộng và tròn bầu. Thường chỉ nhìn thấy khi bay lên, nhưng cũng có thể quan sát được khi Rẽ gà đi kiếm ăn về vào lúc bình minh và bay đi trước khi trời tối. Kiếm ăn vào ban đêm, ban ngày nghỉ ngơi ở những nơi rậm rạp hoặc trong các lùm cây. sống: Rừng, rừng thứ sinh, bụi cây rậm ven bờ suối, không bao giờ ở các vùng đất lầy. Loài di cư', NULL, 'Từ Bắc Bộ đến Nam Trung Bộ. Phân bố lên độ cao khoảng 2.400 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3450, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Tringa', NULL, 'GEN_1992', 'tringaerythropus', 'Tringa erythropus', '(Pallas, 1764)', 'Choắt chân đỏ', 'SPA_03472', '32cm. Mỏ dài hơn Choắt nâu, chóp mỏ hơi khoằm, chân dài hơn, màu trắng lộ rõ trên vùng trước mắt và không có các vằn cánh. Chim ở thời kì sinh sản có màu đen nhánh. Những con gặp vào mùa thu có bộ lông của các con trưởng thành đang thay lông và chim non có sọc màu nâu xám dày đặc ở phía bụng. Mùa đông bộ lông có màu xám rõ nét hơn Choắt nâu. Thường tụ tập thành đàn nhỏ kiếm ăn trong các vùng nước và thường xuyên bơi. Vùng đầm lầy, bãi bồi ngập triều ven biển.Loài di cư. Thỉnh thoảng mới gặp.', NULL, 'Đông Bắc (vùng ven biển Vịnh Bắc Bộ), Bắc Trung Bộ và Trung Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3451, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Tringa', NULL, 'GEN_1992', 'tringaglareola', 'Tringa glareola', 'Linnaeus, 1758.', 'Choắt bụng xám', 'SPA_03473', 'Chim trưởng thành: Bộ lông mùa hè. Mặt lưng nâu có điểm đen nhạt và trắng nhạt. Các lông bao trên đuôi trắng có vạch đen nhạt ở mút lông. Mặt bụng trắng, phớt xám ở cổ và ngực. Ở cổ còn có những vệt dọc dài màu nâu, ở ngực và sườn các vệt này rộng dần và chuyển thành vạch ngang và đến dưới đuôi thì thành nhưng vằn ngang. Trước mắt nâu. Trên mắt và má lấm tấm nâu. Lông cánh sơ cấp nâu thẫm, lông đầu tiên có thân lông trắng.Lông bao dưới cánh trắng có điểm nâu. Lông đuôi trắng có ám vạch ngang nâu đen nhạt.Bộ lông mùa đông. Các lông ở mặt lưng có viền trắng nhạt. Lông ở mặt bụng trắng, cổ và ngực có phớt xám và hơi có vệt nâu rất nhạt Mắt nâu. Mỏ đen nhạt với gốc xám lục nhạt. Chân lục nhạt hay lục vàng.\nKích thước: Cánh: 117 - 133; đuôi: 45 - 54); giò: 36 - 41; mỏ: 26 - 30 mm ', NULL, 'Việt Nam về mùa đông loài choắt hung xám có nhiều ở khắp các vùng đồng bằng những chỗ có nước nông và gần các sông lớn. Loài choắt này làm tổ ở Bắc châu Âu và châu Á; mùa đông di cư về phía Nam: từ Đông Dương, Ấn Độ, Miến Điện đến Phi châu, Mã Lai, xumatra, Java và châu Úc.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(3452, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Tringa', NULL, 'GEN_1992', 'tringahypoleucos', 'Tringa hypoleucos', 'Linnaeus, 1758.', 'Choắt nhỏ', 'SPA_03474', ' 20cm. Đặc điểm dễ nhận biết là khi bay để lộ vằn rộng trên cánh màu trắng và bay thấp trên mặt nước. Cánh vỗ nhẹ xuống dưới (thường gần như chạm vào mặt nước) giữa các vòng lượn. Đầu và đuôi cử động liên tục. Đậu trên các vật thấp. Chim non về mùa thu có thể phân biệt với chim trưởng thành bởi nhiều vằn gợn sóng màu nâu sẫm trên lông bao cánh. Choắt nhỏ thường sống một mình hoặc từng đôi, nhưng thỉnh thoảng cũng có thể thấy nhiều con cùng kiếm ăn trong một vùng hẹp ở nơi có nhiều thức ăn.  Bờ mép nước của ao, hồ, bờ biển; đặc biệt ở các bãi lầy. Loài di trú. Phổ biến.', NULL, 'Đông Bắc (vùng ven biển Vịnh Bắc Bộ), Bắc Trung Bộ, Trung và Nam Trung Bộ, Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3453, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Tringa', NULL, 'GEN_1992', 'tringanebularia', 'Tringa nebularia', '(Gunnerus, 1767)', 'Choắt lớn ', 'SPA_03475', '35cm. Kích thước lớn, mỏ dài, hơi vểnh lên, trông khá nặng nề. Không thấy rõ vằn cánh khi bay. Ngoài mùa sinh sản: Đầu và cổ thường rất nhợt nhạt, phía lưng có màu xám trơn hơn và phần dưới cơ thể màu trắng. Chim non có màu nâu sẫm hơn ở phía trên. Thường kiếm ăn đơn độc nhưng khi di cư bay thành đàn lớn. Sinh cảnh sống: Bãi bồi ngập triều ven biển, vùng đầm lầy. Thích kiếm ăn ở các bãi ngập triều. \nLoài trú đông', NULL, 'Từ vùng Đông Bắc (vùng ven biển Vịnh Bắc Bộ) đến Nam Bộ. ', NULL, NULL, NULL, NULL, 'LC', NULL, 'Vietnam Bird Guide'),
(3454, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Tringa', NULL, 'GEN_1992', 'tringaochropus', 'Tringa ochropus', 'Linnaeus, 1758', 'Choắt bụng trắng', 'SPA_03476', '24cm. Đặc điểm nhận dạng: Dưới cánh có màu đen nhạt, phần lưng trên đuôi để lộ màu trắng tương phản với màu đen phía lưng. Chân màu xanh tối. Khi đậu yên có màu giống như Choắt nhỏ. Không có vằn cánh. Khi bị xua đuổi thì bay lên và kêu to; theo đường bay dích dắc sau đó vọt lên cao, lượn vòng và cuối cùng sà xuống một nơi nào đó ở xa hơn. Thường gặp đi một mình hoặc theo đàn nhỏ. Tiếng kêu: Nghe chói tai ‘uyt-tơ-uyt’ khi bay lên.', NULL, ' Vùng Tây Bắc, Đông Bắc, Bắc Trung Bộ, Trung và Nam Trung Bộ, Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3455, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Tringa', NULL, 'GEN_1992', 'tringasp', 'Tringa sp.', NULL, 'Choắt?', 'SPA_03477', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3456, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Tringa', NULL, 'GEN_1992', 'tringastagnatilis', 'Tringa stagnatilis', '(Bechstein, 1803). ', 'Choắt đốm đen', 'SPA_03478', 'Giống Choắt lớn nhưng nhỏ hơn và mỏ rất mảnh, thon nhọn. Chân dài (thường màu vàng nhạt), kéo lê sau đuôi khi bay. Thường rất sôi động. Ngoài mùa sinh sản bộ lông nhợt nhạt hơn và xám hơn. Khác với Choắt bụng trắng và Choắt bụng xám là trong khi bay thấy màu trắng ở hông như một hình tam giác đến tận lưng.  Sinh cảnh sống: Bãi bồi ngập triều ven biển, vùng đầm lầy. Thường kiếm ăn ở các bãi bùn.\nLoài trú đông', NULL, 'Đông Bắc (vùng ven biển Vịnh Bắc Bộ), Bắc Trung Trung Bộ và Nam Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3457, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Tringa', NULL, 'GEN_1992', 'tringatotanus', 'Tringa totanus', '(Linnaeus, 1758)', 'Choắt nâu ', 'SPA_03479', '27cm. Khi bay dễ nhận thấy dải rộng màu trắng ở đường viền trong cánh. Khi đậu yên, Choắt nâu khác với các loài chim ven biển khác, trừ Choắt chân đỏ, có đôi chân màu đỏ hoặc màu da cam. Bộ lông có màu nâu hơn nhiều so với Choắt chân đỏ. Rất nhát và khi có tác động thì nhảy rất nhanh, sau đó bay vọt lên trời phát ra tiếng kêu gọi đàn. Thường sống thành từng đàn nhỏ. Trong mùa sinh sản: Phía bụng có nhiều sọc đậm. Ngoài mùa sinh sản: Phía lưng chỉ có một màu xám nâu, và ngực có sọc mảnh màu nâu và màu xám nâu rất bóng. Chim non: Phần trên cơ thể có màu nâu với nhiều chấm dày màu nâu sẫm. Tiếng kêu: To, nghe tiếng ‘tiu-hiu-hiu’ có nhạc điệu.', NULL, 'Đông Bắc (vùng ven biển Vịnh Bắc Bộ, Nam Trung Bộ và Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/bird/common-redshank-186'),
(3458, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CHARADRIIFORMES', 'RẼ', 'ORD_017', 'Scolopacidae', 'Rẽ', 'FAM_336', 'Xenus', NULL, 'GEN_2053', 'xenuscinereus', 'Xenus cinereus', '(Güldenstädt, 1775)', 'Choắt chân màng bé', 'SPA_03480', 'Mô tả: 23cm. Mỏ đen, dài và cong, gốc mỏ màu vàng nhạt và chân ngắn, màu da cam. Mỏ dài trông không cân đối so với đôi chân ngắn. Kiếm ăn bằng cách sục xạo lung tung, luôn nhảy nhót. Khi bay thấy rõ vằn cánh màu trắng giống như Choắt chân đỏ. Bộ lông của chim ngoài mùa sinh sản và chim non có màu nâu hơn.', NULL, 'Phân bố: Đông Bắc (vùng ven biển Vịnh Bắc Bộ), Bắc Trung Trung Bộ và Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/vietnamese-name/terek-sandpiper-548'),
(3459, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Ardea', NULL, 'GEN_0150', 'ardeaalba', 'Ardea alba', 'Linnaeus, 1758', 'Cò ngàng lớn', 'SPA_03481', 'Là loài cò trắng lớn nhất, bộ lông hoàn toàn trắng. Khi bay dễ nhận thấy do kích thước lớn. Da mặt màu xanh vàng nhạt. Nhìn gần thì có thể thấy đường đen của góc hai mép mỏ kéo dài dưới mắt là đặc điểm phân biệt với loài Cò ngàng nhỏ. Trong mùa sinh sản: Trên lưng không thấy có các lông dài từ đầu rủ xuống. Mỏ trở nên đen (hoặc một phần như vậy) và phần trên chân có màu xanh nhạt tương phản (đôi khi đỏ ửng). Ngoài mùa sinh sản chim non có mỏ màu vàng. ', NULL, 'Đông Bắc, Trung Bộ, Tây Nguyên và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3460, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Ardea', NULL, 'GEN_0150', 'ardeacinerea', 'Ardea cinerea', 'Linnaeus, 1758', 'Diệc xám', 'SPA_03482', '112cm. Bộ lông màu xám nhạt dễ nhận biết. Khi bay, phần trên của cánh tương phản rõ với mảng khớp mút cánh có màu trắng ở trước cánh. Chim non có màu xám hơn và ít họa tiết hơn chim trưởng thành, và không có mào lông.  Hồ, đầm lầy, sông, rừng ngập mặn, rừng tram, cánh đồng lúa, và các vùng đất ngập nước khác.', NULL, ' Đông Bắc, Bắc Trung Bộ, Trung Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3461, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Ardea', NULL, 'GEN_0150', 'ardeaintermedia', 'Ardea intermedia', 'Wagler, 1829.', 'Cò ngành nhỡ', 'SPA_03483', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3462, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Ardea', NULL, 'GEN_0150', 'ardeapurpurea', 'Ardea purpurea', 'Linnaeus, 1766', 'Diệc lửa', 'SPA_03484', '97cm. Dễ phân biệt nhưng có thể nhầm với Diệc xám. Luôn có màu tối hơn, và gầy hơn Diệc xám. Khi bay, cổ vặn quá mức đến nỗi bị cong lại, bàn chân duỗi dài hơn. Bộ lông phổ biến có màu nâu hung nhạt, cổ nhỏ như con rắn (khi đậu thường thấy cổ nhô cao trên các bãi đước). Đi ăn một mình. Chim non toàn thân màu nâu sẫm hơn, không có mào lông và sọc viền trên cổ.', NULL, 'Đông Bắc, Bắc Trung Bộ, Trung Trung Bộ, Nam Trung Bộ và Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3463, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Ardeola', NULL, 'GEN_0151', 'ardeolabacchus', 'Ardeola bacchus', '(Bonaparte, 1855)            ', 'Cò bợ', 'SPA_03485', 'Cò bợ có chiều dài trung bình 47 cm, thường với bộ lông nền trắng, lưng màu nâu, mỏ vàng với đầu mỏ đen; chân và mắt cò màu vàng. Lông cò chuyển sang màu đỏ, xanh và trắng vào mùa sinh sản. Vào thời gian còn lại lông cò màu nâu xám pha đốm trắng Cò bợ sống ở đầm lầy nước lợ tương đối nông cạn ở vùng ôn đới và bán nhiệt đới Đông Á. Chúng thích vùng đồng bằng với bản địa trải dài từ duyên hải đến vùng núi phía tây. Thức ăn chính của cò bợ là côn trùng, cá và các loài giáp xác. Khi làm tổ, cò bợ sẽ làm xen kẽ với các loài cò khác. Cò đẻ trứng màu xanh lam pha màu lục. Mỗi lứa từ ba đến sáu quả trứng', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Wikipedia'),
(3464, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Ardeola', NULL, 'GEN_0151', 'ardeolaibis', 'Ardeola ibis', '(Linnaeus, 1758)', 'Cò ruồi', 'SPA_03486', 'Cò ruồi có sải cánh 88–96 cm, dài 46–56 centimetres và nặng 270–512 grams. Ngoài mùa sinh sản, cò ruồi có bộ lông trắng, mỏ vàng và chân màu vàng xám. Trong mùa sinh sản, chim trưởng thành chuyển sang màu cam trên lưng, ngực và đầu, còn mỏ, chân và mắt chuyển màu đỏ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/C%C3%B2_ru%E1%BB%93i'),
(3465, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Ardeola', NULL, 'GEN_0151', 'ardeolaspeciosa', 'Ardeola speciosa', 'Horsfield, 1921', 'Cò bợ java', 'SPA_03487', 'Chim trưởng thành:\nBộ lông mùa hè. Cằm, họng và trước cổ trắng. Lông seo và phần còn lại của đầu và cổ nâu vàng nhạt. Lông ở vai vả lưng rất dài và màu đen chì trùm lên cả đuôi. Cánh trắng, các lông cánh thứ cấp cuối cùng và các lông vai ngoài hung nâu. Phần lưng dưới, hông, trên đuôi và đuôi trắng. Các lông hình mũi mác ở ngực và hai bên sườn màu gụ đỏ. Bụng, nách, dưới đuôi và dưới cánh trắng.\nBộ lông mùa đông. Nhìn chung rất giống với loài A. bachus, nhưng đầu và cổ ít màu vàng hung, mà lạI đen nhạt có vạch vằn xám, lông ở lưng và vai nâu nhạt hơn. Mắt vàng nhạt. Mỏ đen ở chóp, nâu sừng ở quanh mũi, xanh nhạt ở gốc và phần còn lại vàng. Chân lục thẫm hay vàng lục nhạt.\n\nKích thước:\nCánh: 199 - 230; đuôi: 78; giò: 62; mỏ: 63 mm.', NULL, 'Cò bợ Mã Lai phân bố ở quần đảo Xông, Xêlêbes, Mã Lai, Nam Thái Lan và Nam Việt Nam.\nViệt Nam loài cò bợ này có ở Châu Đốc và Côn Lôn.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5193'),
(3466, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Botaurus', NULL, 'GEN_0238', 'botaurusstellaris', 'Botaurus stellaris', '(Linnaeus, 1758)', 'Vạc rạ', 'SPA_03488', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3467, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Bubulcus', NULL, 'GEN_0258', 'bubulcuscoromandus', 'Bubulcus coromandus', 'Linnaeus,1758', 'Cò ruồi', 'SPA_03489', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3468, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Bubulcus', NULL, 'GEN_0258', 'bubulcusibis', 'Bubulcus ibis', '(Linnaeus, 1758)', 'Cò ruồi', 'SPA_03490', 'Cò ruồi có sải cánh 88–96 cm, dài 46–56 centimetres và nặng 270–512 grams. Ngoài mùa sinh sản, cò ruồi có bộ lông trắng, mỏ vàng và chân màu vàng xám. Trong mùa sinh sản, chim trưởng thành chuyển sang màu cam trên lưng, ngực và đầu, còn mỏ, chân và mắt chuyển màu đỏ phân bố ở vùng cận nhiệt đới, nhiệt đới và vùng có nhiệt độ ấm.', NULL, '  châu Á, châu Phi và châu Âu.', NULL, NULL, NULL, NULL, NULL, NULL, 'Wikipedia'),
(3469, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Butorides', NULL, 'GEN_0271', 'butoridesstriata', 'Butorides striata', '(Linnaeus, 1758)            ', 'Cò xanh', 'SPA_03492', '46cm. Kích thước cơ thể nhỏ, màu sẫm. Khi bay, phía trên có màu xám lục, phía dưới màu xanh nhạt hơn và thường lộ rõ lòng bàn chân màu da cam. Khi đậu mào thường giương lên. Thường gặp một con. Hay hoạt động vào lúc hoàng hôn. Chim non: Màu xám nâu nhạt sẫm với nhiều vết đốm trắng trên cánh và phía dưới có viền sọc lớn.', NULL, 'Bắc Bộ, Trung Bộ, Tây Nguyên và Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/vietnamese-name/striated-heron-481'),
(3470, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Casmerodius', NULL, 'GEN_0322', 'casmerodiusalbus', 'Casmerodius albus', 'Oberholser, 1919', 'Cò ngàng lớn', 'SPA_03493', '85 - 102 cm.\nChim trưởng thành ngoài mùa sinh sản: Bộ lông hoàn toàn trắng, Da mặt xanh vàng nhạt. Đường đen của góc hai mép mỏ kéo dài dưới mắt. Cỏ hình rắn, dài. Mỏ vàng, dài, nhọt. Chân đen.\nChim non: Rất giống chim trưởng thành ngoài mùa sinh sản.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3471, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Dupetor', NULL, 'GEN_0618', 'dupetorflavicollis', 'Dupetor flavicollis', 'Latham, 1790', 'Cò đen', 'SPA_03494', 'Chim trưởng thành: Mặt lưng và cánh xám đen thẫm có ánh xanh hoặc đen. Phía dưới má hung lẫn hung nâu và đen. Hai bên cổ vàng hung. Cằm và họng trắng ở giữa có một dải nâu. Phía trước cổ đen chì lẫn nâu gụ thẫm và hung nhạt. Các lông dài phía dưới cổ đen chì thẫm viền hung nhạt và trắng. Ngưc, bụng xám chì hay đen nâu, một vài lông ở giữa bụng có viền trắng.\nChim cái: Mặt lưng nhiều nâu hơn mà ít xám. Bụng nâu nhạt hơn, màu trắng ở giữa bụng cũng nhiều hơn. Các lông ở ngực nâu, có vạch trắng và thường phớt hung.\nChim non: Lưng và cánh nâu thẫm, mỗi lông đều có viền nâu hung nhạt, Dưới cổ và trên ngực hung nâu nhạt có vạch thẫm ở giữa và hai bên nhạt. Đỉnh đầu đen hay đen chì. Mắt nâu đỏ hay nâu vàng. Mỏ màu xám sừng hơi hung, mút và nửa ngoài của mỏ dưới vàng nhạt. Da trần ở mặt tím nhạt, mí mắt xanh nhạt. Chân nâu thẫm.\nCánh: 195 - 207; đuôi: 68 - 72; giò: 63 - 67; mỏ: 75 - 81 mm. ', NULL, 'Việt Nam có thể gặp cò hương ở hầu khắp các vùng, nhưng ở vùng đồng bằng có mặt độ cao hơn. Cò hương phân bố ở Ấn Độ, Miến Điện, Thái Lan, Trung Quốc, Đông Dương, Mã Lai và Philipin.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3472, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Egretta', NULL, 'GEN_0632', 'egrettaalba', 'Egretta alba', 'Linnaeus, 1758', 'Cò ngàng lớn', 'SPA_03495', 'Chim trưởng thành:\nBộ lông hoàn toàn trắng Trong mùa sinh sản, các lông ở vai dài có phiến lông thưa. Mỏ đen, da quanh mắt và mép mỏ xanh lục nhạt. Chân đen. Trong mùa đông, mỏ vàng, da quanh mắt vàng hơi thẫm, chân xanh lục nhạt. Không có lông thưa ở vai.\nKích thước:\nCánh: 340 - 391; đuôi: 130 - 160; giò: 152 - 175; mỏ: 109 - 117 mm. ', NULL, 'Việt Nam về mùa đông ở Ấn Độ, Miến Điện, Mã Lai, Trung Quốc và Đông Dương.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3473, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Egretta', NULL, 'GEN_0632', 'egrettaeulophotes', 'Egretta eulophotes', '(Swinhoe, 1860)', 'Cò trắng trung quốc', 'SPA_03496', 'Trong mùa sinh sản: Từ cuối tháng 4 có một chùm lông gáy dài dễ nhận, chân đen, bàn chân vàng, mỏ vàng (đôi khi có màu da cam vào mùa xuân) và da mặt có màu xanh da trời sáng. Ngoài mùa sinh sản: Mào và chùm lông vũ biến mất, chân, mỏ và da mặt trở nên vàng xanh nhạt, có thể lầm với dạng trắng của Cò đen. Cò đen mỏ màu đen nhạt. Khi kiếm ăn, Cò trắng trung quốc năng động, chạy trong khi kiếm mồi, cánh giang rộng, ngược lại Cò đen thường chậm chạp và rón rén săn mồi. ', NULL, ' Đông Bắc Bộ, Nam Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3474, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Egretta', NULL, 'GEN_0632', 'egrettagarzetta', 'Egretta garzetta', '(Linnaeus, 1766)            ', 'Cò ngàng nhỏ ', 'SPA_03497', '61cm. Bộ lông màu trắng, mỏ đen, thon mảnh và các ngón chân màu vàng nổi bật (dễ nhận thấy khi bay). Trong mùa sinh sản: Đầu có hai lông gáy hẹp kéo dài ra từ chùm lông gáy. Thời kì sinh sản có da mặt màu xanh vàng trở nên sáng hơn (thậm chí hơi đỏ). Chim non có mỏ và bàn chân màu nâu nhạt. Đầm lầy, hồ, bãi lầy ngập triều, rừng tràm, rừng ngập mặn và cánh đồng lúa.', NULL, 'Bắc Bộ, Trung Bộ, Tây Nguyên và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3475, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Egretta', NULL, 'GEN_0632', 'egrettaintermedia', 'Egretta intermedia', '(Wagler)', 'Cò ngàng nhỏ', 'SPA_03498', 'Chim trưởng thành:\nBộ lông mùa hè. Bộ lông hoàn toàn trắng, ở vai và lưng cũng có những lông dài và thưa như cò ngàng lớn nhưng tương đối dài hơn. Ở cổ dưới và ngực trên cũng có những lông trang hoàng tương tự như lông ở lưng nhưng ngắn hơn. Mắt vàng. Da quanh mắt xanh lục. Mỏ và chân đen. Bộ lông mùa đông. Không có các lông dài và thưa ở vai. Mỏ vàng, mút mỏ thẫm, gốc mỏ nâu. Da quanh mắt vàng nhạt. Chân đen nhạt, các khớp và phía dưới đùi xanh lục nhạt.\nKích thước:\nCánh: 295 - 333; đuôi: 113 - 125; giò: 110 - 130; mỏ: 73 - 85 mm. ', NULL, 'Việt Nam về mùa đông gặp cò ngàng nhỏ ở các tỉnh thuộc miền Trung và miền Nam. ở Ấn Độ, Miến Điện, Mã Lai, Trung Quốc, Nhật Bản, Philipin và Đông Dương.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3476, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Egretta', NULL, 'GEN_0632', 'egrettasacra', 'Egretta sacra', '(Gmelin, 1789).', 'Diệc đen', 'SPA_03499', '58cm. Loài chim có hai dạng hình thái. Một dạng có bộ lông màu tối, mềm mại đồng nhất, nhưng dưới ánh sáng kém có thể thấy rất tối. Trong mùa sinh sản: Có mào với chùm lông ngắn ở sau gáy và mỏ màu vàng đến màu da cam. Dạng hình thái khác lông trắng nhạt rất giống với Cò trắng trung quốc ngoài mùa sinh sản (có cùng nơi ở) với màu vàng nhạt, chóp mỏ tối màu; chân màu vàng xanh nhạt. Thích ở bờ đá và thường rón rén bắt mồi. Phần lớn sống đơn độc nhưng gặp đàn nhỏ vào mùa đông.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/english-name/pacific-reef-heron-480'),
(3477, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Gorsachius', NULL, 'GEN_0785', 'gorsachiusmagnificus', 'Gorsachius magnificus', '(Ogilvie Grant, 1899).', 'Vạc hoa', 'SPA_03500', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3478, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Grosachius', NULL, 'GEN_0795', 'grosachiusmelanolophus', 'Grosachius melanolophus', '(Raffles).', 'Cò tôm', 'SPA_03502', 'Cao khoảng 47 cm. Con trưởng thành có màu nâu đỏ với phần dưới có sọc, phần dưới cánh màu đen và vương miện màu đen. Các vết truyền thuyết có màu xanh lam nhưng có thể thay đổi màu sắc sau khi lột xác. Giới tính tương tự nhau, nhưng con đực có thể có mào sẫm màu hơn và một số loài chim, đặc biệt là con cái, có thể giữ lại bộ lông non. Con non có màu nâu xám với các đốm đen và trắng, phần dưới có sọc. Loài chim này xuất hiện ở các đầm lầy, suối và đầm lầy cận nhiệt đới và nhiệt đới, đặc biệt là ở những vùng có lượng mưa lớn. Nó làm tổ trong rừng trên cây và tre, và kiếm ăn ở những khu vực trống trải. Thức ăn phổ biến nhất là giun đất và ếch, đôi khi nó cũng ăn cá.', NULL, ' miền đông châu Á, sinh sản ở Ấn Độ, Đài Loan, Trung Quốc và Philippines.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/group/malayan-night-heron-225'),
(3479, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Ixobrychus', NULL, 'GEN_0982', 'ixobrychuscinnamomeus', 'Ixobrychus cinamomeus', '(Gmelin, 1789)', 'Cò lửa', 'SPA_03503', '41cm. Bộ lông khi bay có màu hung nâu rất đặc trưng. Chim trống: Toàn bộ phần trên cơ thể phủ đều một màu nâu vàng sáng. Mỏ màu đỏ khi mùa sinh sản bắt đầu. Chim mái: Như chim đực nhưng phần lưng tối hơn, phần dưới cơ thể xám xịt hơn, có nhiều viền sọc hơn. Chim non: Màu nâu hơn, phần trên cơ thể có nhiều vệt và điểm nâu sẫm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/english-name/cinnamon-bittern-476'),
(3480, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Ixobrychus', NULL, 'GEN_0982', 'ixobrychuseurhythmus', 'Ixobrychus eurhythmus', '(Swinhoe, 1878)', 'Cò lùn nâu', 'SPA_03504', 'Chim đực trưởng thành:\nĐỉnh đầu đen phớt nâu gụ. Hai bên đầu, eo, lưng, vai nâu gụ. Hông và trên đuôi nâu xám nhạt. Lòng cánh và lông đuôi nâu phớt xám. Bao cánh hung xám. Họng trắng nhạt, trước cổ, ngực và bụng hung phớt vàng thiên lý với một dải thẫm dọc trước cổ và vài điểm đen nhạt ở các lông dài phía dưới cổ. Dưới đuôi màu sáng hơn.\nChim cái:\nGần giống chim đực nhưng có nhiều đốm nâu thẫm lẫn trắng ở lưng và vai. Bao cánh có nhiều vệt hung. Ngực và bụng có nhiều vạch nâu.\nChim non:\nGiống chim cái, nhưng nâu hơn và có nhiều vệt màu vàng nhạt hơn. Mắt vàng đến đỏ lục nhạt. Ở trên nâu thẫm, mỏ dưới vàng nâu nhạt. Chân lục.\nKích thước:\nCánh: 135 - 152; giò: 47; mỏ: 53mm. ', NULL, 'gặp một vài con nghỉ đông ở phía Bắc Bắc bộ. phân bố ở đông Trung Quốc, Đông nam Liên Xô và Nhật Bản.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3481, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Ixobrychus', NULL, 'GEN_0982', 'ixobrychusflavicollis', 'Ixobrychus flavicollis', '(Latham, 1790)', 'Cò hương', 'SPA_03505', 'Bộ lông có màu rất tối (trông như màu đen khi bay), mỏ hình con dao găm, dài không cân đối. Cổ rất dài, khi bay có dạng hình nửa chữ S kéo dài. Hoạt động kín đáo và chủ yếu đi ăn vào đêm. Chim trống: màu đen nhạt, họng, cổ và ngực trên có viền sọc màu vàng da bò sẫm. Chim mái: Tương tự như chim đực nhưng nâu hơn. ', NULL, 'Bắc Bộ, Trung Bộ, Tây Nguyên và Nam Bộ. ', NULL, 'Bãi sậy, đầm lầy, rừng ngập mặn, cánh đồng lúa và các suối trong rừng.', NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3482, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Ixobrychus', NULL, 'GEN_0982', 'ixobrychussinensis', 'Ixobrychus sinensis', '(Gmelin, 1789)', 'Cò lửa lùn', 'SPA_03506', '38cm. Khi bay dễ phân biệt, bộ lông màu đen tương phản với lông bao cánh màu vàng nhạt và lưng trên màu nâu tối. Thường đậu ở trên cây đước và ngọn cây sậy. Hoạt động vào ban ngày. Chim trưởng thành: Đỉnh đầu đen, phần trên cơ thể nâu nhạt, phần dưới cơ thể nâu sẫm. Chim non: Phần trên và dưới cơ thể đều có viền sọc lớn.', NULL, 'Bắc Bộ, Trung Bộ, Tây Nguyên và Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3483, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Mesophoyx', NULL, 'GEN_1209', 'mesophoyxintermedia', 'Mesophoyx intermedia', 'Wagler , 1827', 'Cò ngàng nhỏ', 'SPA_03507', '70cm. Trong mùa sinh sản: Lông vũ dài ở phần ngực trên và vùng lưng dưới, chân và ngón chân đen nhạt; da mặt vàng sáng; mỏ trên đen chỉ trong một thời kì ngắn vào mùa xuân. Ngoài mùa sinh sản: Mỏ vàng xám xịt với chóp mỏ tối và phía cuối thường sẫm hơn. Cò ngàng nhỡ được phân biệt với Cò ngàng lớn bởi mỏ ngắn và mập hơn với chóp mỏ màu đen và đường viền góc mép mỏ màu đen đến dưới mắt. Rón rén bắt mồi. Hồ, đầm lầy, rừng ngập mặn, bãi cát ngập triều và cánh đồng lúa. : Loài định cư. Không phổ biến.', NULL, 'Đông Bắc, Trung Bộ, Tây Nguyên và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Birdwatchingvietnam'),
(3484, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CICONIIFORMES', 'HẠC', 'ORD_020', 'Ardeidae', 'Diệc', 'FAM_030', 'Nycticorax', NULL, 'GEN_1344', 'nycticoraxnycticorax', 'Nycticorax nycticorax', '(Linnaeus, 1758)            ', 'Vạc', 'SPA_03508', 'Chim trưởng thành: Bộ lông mùa hè. Trước mắt, trán, lông mày và lông seo trắng. Đỉnh đầu, gáy, mào, lưng và vai xám đen có ánh xanh. Cằm, họng, trước cổ, giữa ngực, bụng và dưới đuôi trắng. Phần còn lại của bộ lông xám tro hơi nhạt ở cổ và thẫm hơn ở cánh và đuôi. Bộ lông mùa đông. ánh xanh ở bộ lông mùa đông nhạt hơn so với bộ lông mùa hè.\nChim non: Bộ lông mùa hè thứ nhất giống như bộ lông của chim trưởng thành nhưng ánh xanh thép nhạt hơn. Mặt lưng phớt nâu, thân lông hung nhạt. Bộ lông mùa đông thứ nhất: không có ánh xanh thép hay có nhưng rất nhạt, mặt lưng nâu có vạch hung, các vạch này rộng dần và nhạt dần ở các lông bao cánh. Các lông cánh sơ cấp và thứ cấp xám tro với vệt trắng ở mút lông. Mặt dưới trắng hay trắng phớt hung có vạch nâu thẫm. Mắt đỏ. Mỏ đen với gốc mỏ và phần lớn mỏ dưới lục nhạt vàng. Da trần quanh mắt và chân lục vàng nhạt. Vào mùa sinh sản mỏ đen hơn, chân hơi hung đỏ, da mặt đỏ - đen nhạt.\nKích thước: Cánh: 250 - 304; đuôi: 79 - 107; giò: 69 - 73; mỏ: 61 - 75 mm. ', NULL, 'Việt Nam, vạc có ở khắp các vùng, nhưng mật độ ở vùng đồng bằng cao hơn. Vạc phân bố ở Nam và trung châu Âu, châu Phi, Trung Á, Ấn Độ, Xâyan, Miến Điện, Thái Lan, Lào, Campuchia, Việt Nam, Trung Quốc, Triều Tiên, Nhật Bản, Mã Lai, Bocnêô, Xumatra và Java', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3485, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COCONIIFORMES', 'HẠC', 'ORD_022', 'Ciconiidae', 'Hạc', 'FAM_087', 'Anastomus', NULL, 'GEN_0090', 'anastomusoscitans', 'Anastomus oscitans', 'Boddaert , 1783', 'Cò nhạn, Cò ốc', 'SPA_03509', 'Chim trưởng thành: Mùa hè, các lông cánh sơ cấp, lông cánh thứ cấp, lông vai dài nhất, cánh con, lông bao cánh sơ cấp và thứ cấp, lông đuôi màu đen có ánh lục hay hồng. Phần còn lại của bộ lông màu trắng. Mùa đông, các lông trắng ở mặt lưng được thay thế bằng lông xám nhạt. Mắt trắng, xám vàng nhạt hay nâu nhạt. Mỏ xám sừng hơi lục, phần dưới mỏ hơi hung. Da trần quanh mắt màu đen. Chân hồng vàng nhạt hay hồng nâu nhạt. Kích thước cơ thể lớn với đặc điểm nổi bật là mỏ trên và dưới không khép chặt vào nhau ở đoạn giữa mà chỉ ở chóp và gốc mỏ.\n\nChim non: Đầu, cổ và trước ngực có màu nâu xám nhạt. Vai màu nâu đen nhạt, các lông đều viền xám hung nhạt. Nơi sống: ở các sinh cảnh khác nhau của các vùng đất ngập nước như là hồ ao, kênh mương, sông, bãi bùn ngập nước, ruộng lúa. Thức ăn chủ yếu là ốc, các động vật thuỷ sinh như ếch nhái, cua, côn trùng lớn. Chưa có nhiều dẫn liệu về sinh sản của loài này, theo tài liệu thì cò nhạn làm tổ tập đoàn cùng một số loài cò, diệc, cò quăm. Tổ của chúng làm rất gần nhau. Thường đẻ 4 trứng, ấp 27 - 30 ngày. ở nước ta trước đây chúng làm tổ ở một vài sân chim như Bạc Liêu, Đầm Dơi, Cái Nước.', NULL, 'Đồng bằng sông Cửu Long và tỉnh Tây Ninh. Ấn Độ, Xri Lanka, Nêpan, Mianma, Thái Lan, Lào, Cămpuchia.', NULL, NULL, 'Là nguồn gen qúy, hấp dẫn cho tham quan du lịch sinh thái.', 'VU', NULL, NULL, 'vncreatures.net'),
(3486, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COCONIIFORMES', 'HẠC', 'ORD_022', 'Ciconiidae', 'Hạc', 'FAM_087', 'Ciconia', NULL, 'GEN_0410', 'ciconiaepiscopus', 'Ciconia episcopus', 'Boddaert, 1783', 'Hạc cổ trắng', 'SPA_03510', '75-91cm. Bộ lông nhìn chung có màu đen bóng, cổ trắng, mỏ tối màu, chân đỏ.', NULL, 'Nam Trung Bộ, Nam Bộ. Tìm thấy ở Đắc Lắc, Cát Tiên, Đồng Tháp, Cà Mau và Kiên Giang.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/vietnamese-name/woolly-necked-stork-294'),
(3487, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COCONIIFORMES', 'HẠC', 'ORD_022', 'Ciconiidae', 'Hạc', 'FAM_087', 'Ephippiorhynchus', NULL, 'GEN_0658', 'ephippiorhynchusasiaticus', 'Ephippiorhynchus asiaticus', 'Latham , 1790', 'Cò á châu, Hạc cổ đen', 'SPA_03511', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3488, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COCONIIFORMES', 'HẠC', 'ORD_022', 'Ciconiidae', 'Hạc', 'FAM_087', 'Leptoptilos', NULL, 'GEN_1061', 'leptoptilosjavanicus', 'Leptoptilos javanicus', 'Horsfield, 1821', 'Già đẩy Java', 'SPA_03512', 'Chim trưởng thành: Mùa hè: Đầu và cổ trần, thỉnh thoảng có vài lông màu nâu. Mặt lưng, cánh và đuôi màu đen ánh lục, có một vệt rộng ánh đồng ở gần mút lông bao cánh nhỡ lớn nhất. Các lông vai dài nhất và lông cánh tam cấp viền màu trắng. Bao dưới cánh màu đen, mặt bụng trắng. Mùa đông: không có vệt ánh đồng ở cánh. Mắt màu trắng. Mỏ vàng xỉn, chóp mỏ trắng nhạt trong mùa sinh sản , gốc mỏ màu đỏ. Mặt và cổ màu vàng tươi, trong mùa sinh sản có màu phớt đỏ gạch. Da trần ở đỉnh đầu nâu nhạt. Chân lục nhạt hay đen nhạt.\n\nChim non: Đầu và cổ có nhiều lông, không có ánh lục ở các lông màu đen. Nơi sống: Rừng ngập mặn, bãi bồi ven biển, những bãi cỏ ngập nước, hồ, cánh đồng trồng lúa. Thức ăn chủ yếu là cá, đôi khi gặp ăn cả ếch nhái, rắn. Mùa sinh sản từ tháng 11 - năm sau. Thường làm tổ ở những cây to cao gần nước, làm tổ tập đoàn. Đẻ 2 lứa, mỗi lứa đẻ trung bình 4 trứng.', NULL, 'Nam Trung Bộ và Nam Bộ, thường gặp ở Đồng Nai trong các khu rừng ngập nước (Vườn quốc gia Cát Tiên), các vùng đất ngập nước ở Đồng Tháp Mười (Tràm Chim, Tam Nông, Đồng Tháp), ven biển đồng bằng sông Cửu Long và rừng tràm U Minh, cũng như ở Vườn quốc gia Yok Don (Đắk Lăk). Ấn Độ, Xri Lanka, Mianma, Đông nam Trung Quốc, Thái Lan, Lào, Cămpuchia, Malaixia.', NULL, NULL, 'Nguồn gen qúy hiếm có giá trị khoa học cao.', 'VU', NULL, NULL, 'vncreatures.net'),
(3489, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COCONIIFORMES', 'HẠC', 'ORD_022', 'Ciconiidae', 'Hạc', 'FAM_087', 'Mycteria', NULL, 'GEN_1268', 'mycterialeucocephala', 'Mycteria leucocephala', '(Pennant, 1769)', 'Cò lao Ấn độ', 'SPA_03513', 'Chim trưởng thành: Lông cánh sơ cấp, thứ cấp và đuôi đen có ánh lục. Lông bao cánh nhỏ nhỡ màu đen có viền trắng. Vai, lông bao cánh lớn và lông tam cấp trắng phớt hồng. Lông dưới cánh và một dải vòng quanh dưới ngực đen, có ánh xanh, trong đó nhiều lông có viền trắng. Phần còn lại của bộ lông màu trắng.  Chủ yếu xuất hiện vào mùa đông. Tại vùng Đông Bắc thuộc loài lang thang. Cửa sông ven biển, vùng xình lầy, rừng tràm và đồng cỏ ngập nước ngọt, hồ và trên các cánh đồng lúa.', NULL, 'Đông Bắc, Trung và Nam Trung Bộ, Nam Bộ. Thường gặp ở một số tỉnh đồng bằng sông Cửu Long như Kiên Giang, An Giang và Cà Mau, có ghi nhận tại Cát Tiên, York Don, Bình Thuận. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Birdwatchingvietnam'),
(3490, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Chalcophaps', NULL, 'GEN_0359', 'chalcophapsindica', 'Chalcophaps indica', '(Latham, 1790)            ', 'Cu luồng', 'SPA_03514', '25cm. Thường gặp đi lẻ kiếm ăn dọc đường mòn ở rừng. Bộ lông màu xanh sẫm, có hai vằn màu trắng ở lưng dưới. Chim mái giống chim đực nhưng gáy và đỉnh đầu có màu nâu và không có mảng trắng ở góc cánh. sống: Rừng, thảm rừng thứ sinh. Sinh sản từ khoảng tháng 4-11. Làm tổ trên cây, đẻ 2 trứng.', NULL, 'Khắp các vùng trong cả nước, gặp từ đồng bằng, trung du đến miền núi. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3491, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Columba', NULL, 'GEN_0455', 'columbalivia', 'Columba livia', 'Gmelin, 1789', 'Gầm ghì đá', 'SPA_03515', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3492, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Columba', NULL, 'GEN_0455', 'columbapunicea', 'Columba punicea', '(Blyth, 1842)', 'Bồ câu nâu', 'SPA_03516', 'Chim trưởng thành: Đỉnh đầu, gáy màu trắng nhạt; da trần quanh mắt đỏ tím; bộ lông màu nâu tối. Phía lưng màu nâu thẫm hơi tía; lưng trên và hai bên cổ phớt xanh lá cây. Đuôi không có vằn màu hơi đen. Mỏ trắng ngà, gốc mỏ đỏ. Chân đỏ. Chim non: Đỉnh đầu và gáy màu nâu xỉn. ', NULL, 'Đông Bắc (đảo Ba Mùn thuộc tỉnh Quảng Ninh), Trung Trung Bộ (Quảng Trị, Thừa Thiên Huế) và Nam Trung Bộ (Di Linh, Lạc Dương và vùng hồ Tuyền Lâm thuộc tỉnh Lâm Đồng) ', NULL, NULL, NULL, 'VU', NULL, NULL, 'birdwatchingvietnam.net'),
(3493, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Ducula', NULL, 'GEN_0616', 'duculaaenea', 'Ducula aenea', '(Linnaeus, 1766)            ', 'Gầm ghì  lưng xanh', 'SPA_03517', '42-47cm. Cận, hông, trên đuôi và bao cánh có màu xanh lục ánh đồng. Đầu, cổ, lót và xám tro. Phần dưới của trang. Mỏ xám, chân đỏ.  sống: Các kiểu rừng. Có thể tăng tốc độ khoảng 900 mét. Sinh sản từ khoảng tháng 1-5 hay 9, sinh 1-2 trứng.', NULL, 'Các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3494, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Ducula', NULL, 'GEN_0616', 'duculabadia', 'Ducula badia', '(Raffles, 1822)            ', 'Gầm gì lưng nâu', 'SPA_03518', 'Là loài chim bồ câu lớn nhất trong phạm vi của nó với chiều dài 43–51 cm (17–20 in). Nó có một cái đuôi khá dài, đôi cánh tròn, rộng và nhịp đập cánh chậm. Đầu, cổ và phần dưới có màu xám vinous với cổ họng màu trắng tương phản, phần trên và cánh màu nâu hạt dẻ, mặc dù phần trên của cơ thể có thể xỉn màu hơn. Cánh dưới có màu xám đá phiến và đuôi màu đen với một đường ngang màu xám. Sự kết hợp giữa lưng màu hạt dẻ với kích thước lớn mang lại cho loài này một vẻ ngoài đặc biệt. Tiếng gọi của nó bao gồm một tiếng nổ vang sâu, cộng hưởng mà chỉ có thể phát hiện được ở cự ly gần.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3495, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Geopelia', NULL, 'GEN_0751', 'geopeliastriata', 'Geopelia striata', '(Linnaeus, 1766)', 'Cu vằn', 'SPA_03519', ' 22cm. Giống con non loài Cu đất nhưng nhỏ hơn và xám hơn ở phần trên với các vằn ngang và không có sọc dọc. Cổ và hông vằn đen-trắng.', NULL, 'Từ Nam bộ đến Nam Trung bộ', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3496, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Macropygia', NULL, 'GEN_1147', 'macropygiaruficeps', 'Macropygia ruficeps', 'Delacour, 1928', 'Gầm ghì đầu hung', 'SPA_03520', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3497, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Macropygia', NULL, 'GEN_1147', 'macropygiaunchall', 'Macropygia unchall', '(Wagler, 1827)            ', 'Gầm ghì  vằn', 'SPA_03521', '38cm. Khác loài Cu sen bởi đuôi có vằn và dài hơn; phần trên cơ thể đồng màu hơn. Phía sau cổ có màu xanh óng ánh. Chim trống có phần dưới cơ thể màu hồng xám nhạt. Kiếm ăn cả trên cây lẫn trên mặt đất sống: Rừng thường xanh, loại rừng thứ sinh. Làm tổ trên cây, đẻ 1-2 trứng.', NULL, 'Các vùng trong cả nước. Độ cao phân bố khoảng 400-1.800 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3498, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Spilopelia', NULL, 'GEN_1844', 'spilopeliachinensis', 'Spilopelia chinensis', '(Scopoli, 1768)', 'Cu gáy', 'SPA_03522', '30cm. Có vòng cổ màu đen với những đốm trắng (bộ lông khoe mẽ). Lông đuôi bên ngoài trắng ở mút khi bay nhìn thấy khá rõ (đặc biệt là lúc đáp xuống đất). Khi bị tác động chúng bay vụt lên nghe rõ tiếng vỗ cánh. Thường kiếm ăn trên mặt đất. Đi lẻ, đôi hoặc theo đàn. Chim non có màu xám xỉn hơn.  Vùng trống trải và cây bụi, rừng trồng, vườn cây và các khu vực canh tác khác nhau. Làm tổ trên cây, đẻ từ 2-3 trứng.', NULL, 'Khắp các vùng trong cả nước, gặp từ đồng bằng, trung du đến miền núi. Phân bố đến độ cao khoảng 2.000 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3499, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Streptopelia', NULL, 'GEN_1870', 'streptopeliachinensis', 'Streptopelia chinensis', '(Scopoli, 1786)            ', 'Cu gáy ', 'SPA_03523', '30cm. Có vòng cổ màu đen với những sản phẩm khai thác trắng (bộ lông khỏe mạnh). Lông bên ngoài trắng ở thời điểm nhìn thấy khá rõ (đặc biệt là lúc đáp xuống đất). Khi thiết bị hoạt động, chúng bay lên nghe tiếng gió cánh. Thường xuyên kiếm ăn trên mặt đất. Đi lẻ, trùng lặp hoặc theo đàn. Chim non có màu xám hơn. sống: Vùng trũng và cây bụi, rừng trồng, vườn cây và các khu vực canh tác khác nhau. Làm tổ trên cây, sinh từ 2-3 trứng.', NULL, 'Khắp các vùng trong cả nước, tìm từ đồng bằng, trung du đến miền núi. Phân vùng bố trí với khoảng cách cao 2.000 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3500, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Streptopelia', NULL, 'GEN_1870', 'streptopeliaorientalis', 'Streptopelia orientalis', '(Latham, 1790)            ', 'Cu sen', 'SPA_03524', '32cm. Cơ sở kích thước lớn hơn Cu gáy. Vẩy màu tối nhiều màu đỏ hung ở phần trên cơ sở. Chim trưởng thành có mảng cổ màu xám xanh nhạt với 5 sọc đen. Hồng màu xanh nhạt. Các loại lông lông màu xám nhạt tạo nên một dải hoàn chỉnh. Chim mái và chim non có màu xám hơn. sống: Rừng thưa, rừng thứ sinh, vùng cây bụi và các khu đất trải nghiệm. Sinh sản từ khoảng tháng 2-4. Đẻ 2.', NULL, 'Khắp các vùng trong cả nước ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3501, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Streptopelia', NULL, 'GEN_1870', 'streptopeliatranquebarica', 'Streptopelia tranquebarica', '(Hermann, 1804)            ', 'Cu ngói', 'SPA_03525', '23cm. Nhỏ hơn và đuôi ngắn hơn Cu gáy. Vòng đen ở sau cổ nổi bật. Lông đuôi ngoài trắng. Thường đậu thành đàn và thích các vùng đất trồng trọt thấp gần bờ biển. Chim trống: Phía lưng màu nâu đỏ sẫm tương phản với đầu màu xám xanh nhạt, hông và đuôi màu đá xám. Chim mái: Màu nâu xám sẫm, đôi khi phớt hồng.  sống: Vùng quê thoáng đãng, nơi nhiều cây bụi, rừng thứ sinh. Gặp nhiều đàn lớn sống trong rừng tràm ở đồng bằng sông Cửu Long (1999). Làm tổ trên cây, đẻ 2-3 trứng.', NULL, ' Khắp các vùng từ đồng bằng, trung du đến miền núi. Phân bố đến độ cao khoảng 1.200 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3502, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Treron', NULL, 'GEN_1978', 'treronapicauda', 'Treron apicauda', 'Blyth, 1846            ', 'Cu xanh đuôi nhọn', 'SPA_03526', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3503, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Treron', NULL, 'GEN_1978', 'treronbicinctus', 'Treron bicincta', '(Jerdon, 1840)', 'Cu xanh khoang cổ', 'SPA_03527', 'tương tự như các loài chim bồ câu xanh khác bao gồm bồ câu xanh chân vàng và bồ câu xanh trán xám nhưng không có màu hạt dẻ trên cánh. Con đực không có bất kỳ màu xám nào trên đầu nhưng có một dải màu hoa cà hẹp ở phần trên của ngực và một dải màu cam rộng hơn ở bên dưới. Các tấm phủ ở đuôi có màu quế với các lông dài hơn có viền màu vàng. Đuôi có màu xám phía trên với một dải màu tối rộng ở phần dưới. Con cái có màu vàng bên dưới và không có dải màu cam hoặc màu hoa cà. Các lớp phủ ở đuôi có màu quế xỉn hơn với các đốm màu xanh lục. Tuy nhiên, phần đuôi trên có các lông ở giữa màu xám đen chứ không phải màu xanh lục như ở con cái của T. affinis hoặc T. pompadora. Quần thể Sri Lanka (T. b. leggei) có chiều dài cánh nhỏ hơn một chút nhưng mặt khác thì tương tự nhau.  thường sống đơn lẻ hoặc theo nhóm nhỏ. Chuyến bay của nó rất nhanh và trực tiếp, với nhịp đập đều đặn và đôi khi có những cú đập cánh sắc bén, đặc trưng của loài chim bồ câu nói chung. Chúng ăn hạt và quả của nhiều loại thực vật, thường tham gia cùng các loài ăn quả khác khi đậu quả, kiếm ăn bằng cách đi chậm dọc theo cành Chúng được biết là ănnó ăn chủ yếu là trái cây nhỏ. Những con đực đánh nhau trong mùa sinh sản, dùng cánh vỗ vào nhau và mổ nhau. Mùa sinh sản ở Ấn Độ là từ tháng 3 đến tháng 9 nhưng chủ yếu là trước tháng 6. Ở Sri Lanka chúng sinh sản chủ yếu từ tháng 12 đến tháng 5. Tổ là một cái nền mỏng manh điển hình gồm một vài cành cây, trong đó có hai quả trứng màu trắng được đẻ. Cả hai giới đều ấp và trứng nở trong khoảng 12 đến 14 ngày.', NULL, ' được tìm thấy trên khắp châu Á nhiệt đới phía nam dãy Himalaya trên khắp các vùng của Tiểu lục địa Ấn Độ và Đông Nam Á. ', NULL, NULL, NULL, NULL, NULL, NULL, 'thainationalparks'),
(3504, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Treron', NULL, 'GEN_1978', 'treroncurvirostra', 'Treron curvirostra', '(Gmelin, 1789)            ', 'Cu xanh mỏ quặp', 'SPA_03529', ' 27cm. Khác Cu xanh bụng trắng ở chỗ mỏ dày, màu xanh nhạt và vành mắt rộng sống: Các loại rừng, cả rừng tràm và đôi khi gặp ở rừng ngập mặn. Sinh sản từ khoảng tháng 1-9, làm tổ trên cây, sinh 2 trứng.', NULL, 'Khắp các vùng rừng trong cả nước ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3505, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Treron', NULL, 'GEN_1978', 'treronfulvicollis', 'Treron fulvicollis', '(Wagler)', 'Cu xanh cổ nâu', 'SPA_03530', 'Chim đực trưởng thành: Đầu, cổ và ngực trên hung nâu, mặt trên thẫm, mặt dưới hơi nhạt và phớt vàng, chuyển dần thành vàng cam nâu ở phần dưới ngực. Vai, lưng và lông bao cánh nhỏ nâu đỏ. Hông xám đen, chuyển thành xanh lục vàng ở trên đnôi. Lông đuôi giữa xanh lục vàng thẫm, các lông khác xám vàng với một dải đen và xám ở mút lông. Bụng xanh lục vàng lẫn xám; màu này thay đổi tùy con. Sườn xám, chuyễn thành xám đen ở phần sau. Lông ở đùi và quanh hậu môn vằn lẫn xám. Dưới đuôi hung nâu, một số lông dài, có điểm xanh lục ở giữa lông. Lông cánh sơ cấp đen, có viền vàng nhạt, lông cánh thứ cấp, lông bao cánh lớn và nhỡ đen viền vàng. Dưới cánh và nách xám. Mắt hung hồng. Da quanh mắt xám lục. Mỏ: phần ngoài đỏ thẫm, phần gốc xanh pha lục nhạt. Chân hồng tươi.\nChim cái: Các lông hung nâu và nâu đỏ ở mặt lưng thay thế bằng xanh lục vàng thẫm, lẫn ít xám ở bụng. Đỉnh đầu cho đến gáy xám. Cằm thỉnh thoảng có vệt hung nhạt, dưới đuôi hung nâu nhạt có vết xanh lục ở phần gốc lông. Mắt: vòng ngoài hồng, vòng trong xanh nhạt. Chân có màu nhạt hơn chân chim đực.\nKích thước: Cánh (đực): 136 - 148. (cái): 142; đuôi: 90; giò: 20; mỏ: 20 mm. ', NULL, 'Việt Nam: loài này có nhiều ở Nam Bộ. Loài cu xanh cổ nâu phân bố ở Tênaxêrim, Mã Lai, Inđônêxia và Việt Nam, Thài Lan', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(3506, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Treron', NULL, 'GEN_1978', 'treronphoenicopterus', 'Treron phoenicopterus', '(Latham, 1790)', 'Cu xanh chân vàng', 'SPA_03531', 'Chim trưởng thành: Trán, trước đỉnh đầu, cằm, họng, bên đầu và trước ngực xanh lục vàng nhạt, chuyển dần thành vàng nhạt ở phần tiếp theo. Phía sau đỉnh đầu, gáy và sau cổ xám tro thẫm, chuyển dần thành xám xanh lục vàng thẫm ở phần dưới cổ. Một dải hẹp xám nhạt ở vai. Hai bên cổ lục vàng pha nâu nhạt. Lưng, hông và trên đuôi lục vàng xám nhạt. Lông bao cánh nhỏ nâu tím nhạt; các lông bao cánh khác lục vàng xám, các lông bao cánhlớn viền vàng nhạt với một dải gần mút lông đen. Lông cánh đen hơi phớt lục và viền vàng. Lông cánh tam cấp xanh lục vàng xám nhạt. Dưới cánh xám sáng. Lông đuôi vàng phớt lục, với mép phiến lông trong xám và khoảng nửa phía trong đen. Dưới đuôi nâu. Ngực dưới và sườn xám sáng, giữa bụng và đùi vàng nghệ. Xung quanh hậu môn vàng nhạt có điểm xám lục. Mắt: vòng ngoài vàng hồng, vòng trong xanh nhạt. Da gốc mỏ và quanh mắt xanh pha lục nhạt. Chóp mỏ xám sừng (mỏ khỏe, phần chóp mỏ sừng chiếm khoảng nửa chiều dài mỏ, cong xuống). Chân vàng tươi.\nKích thước: Cánh (đực): 177 - 193, (cái): 174 - 185; đuôi: 100 - 110; giò: 17 - 21; mỏ: 18 - 21mm. ', NULL, 'Việt Nam đã bắt được loài này ở Ninh Thuận và Kontum Loài cu xanh này phân bố ở Thái Lan, hạ Lào, và Nam Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(3507, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Treron', NULL, 'GEN_1978', 'treronpompadora', 'Treron pompadora', '(Gmelin, JF, 1789)', 'Cu xanh đuôi đen', 'SPA_03532', 'Chim đực trưởng thành: Trán và trước mắt xanh lục vàng nhạt. Đỉnh đầu và gáy xám, hai bên đầu hơi thẫm hơn. Phía trên cổ và trên vai xanh lục. Lưng, vai và lông bao cánh nhỏ nâu. Lưng dưới, hông và trên đuôi xanh lục, hơi nhạt hơn so với phần trên lưng. Các lông đuôi giữa xanh lục có mút lông xanh, các lông khác chuyển dần thành màu đen từ trong ra ngoài. Các lông bao cánh nhỡ và lớn đen, viền vàng chuyển thành xám ở phiến lông trong. Lông cánh đen chuyển thành xám ở các phiến lông trong, các lông cánh sơ cấp viền trắng vàng nhạt còn các lông thứ cấp có mép vàng rộng. Cằm và họng xanh lục. Phần dưới ngực, bụng và sườn xanh lục nhạt, phần quanh hậu môn và dưới đuôi nâu, có điểm vàng. Nách và dưới cánh xám, phớt xanh lục.\nChim cái: Các lông màu nâu ở mặt lưng và màu cam ở mặt bụng được, thay bằng màu xanh lục. Mắt: vòng ngoài hồng, vòng trong xanh nhạt. Da quanh mắt xanh nhạt hay xám tro nhạt. Mỏ trắng xanh nhạt, mỏ dưới nhạt hơn, gốc mỏ hơi thẫm. Chân đỏ.\nKích thước: Cánh (đực): 143 - 165, (cái): 145 - 160 mm. ', NULL, ' loài này có nhiều ở Nam bộ (An Bình). Chúng thường hay đậu trên các bụi tre. Loài cu xanh đuôi đen phân bố ở đông Ấn Độ, Axam, Miến Điện, Lào và Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(3508, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Treron', NULL, 'GEN_1978', 'treronseiboldii', 'Treron seiboldii', '(Temminck, 1835).', 'Cu xanh bụng trắng', 'SPA_03533', 'Chim đực trưởng thành: Mặt lưng màu lục xám, trán hơi phớt vàng cam, vai và lưng trên phớt xanh, hông, trên đuôi và đuôi phớt đen. Các lông bao cánh nhỏ và nhỡ nâu gụ tươi tạo thành đám nâu gụ lớn ở cánh. Họng và phần dưới ngực vàng phớt lục. Ngực và phần dưới cổ vàng cam phớt hung nhạt. Bụng và dưới đuôi trắng có vệt lục hình mũi tên.\nChim cái: Màu lục thẫm hơn, đầu xỉn hơn, mặt bụng nhiều màu lục, ít màu vàng và không có màu hung. Ở cánh không có đậm nâu gụ. Mắt: vòng trong xanh lơ, vòng ngoài hồng. Mỏ xanh lơ chóp mỏ xanh xám. Da quanh mắt và trước mắt xanh lơ tươi. Chân đỏ thẫm phớt tím.\nKích thước: Cánh (đực): 171 - 187, (cái): 164 - 180; đuôi: 123; giò: 22; mỏ: 20mm. ', NULL, 'Cu xanh bụng trắng phân bố ở miền Bắc Việt Nam từ biên giới Trung Quốc cho đến Thừa Thiên. So với các loài khác, thì loài cu xanh này hiếm. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(3509, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Treron', NULL, 'GEN_1978', 'treronseimundi', 'Treron seimundi', '(Robinson, 1910)            ', 'Cu xanh seimun', 'SPA_03534', 'Chim đực trưởng thành mặt lưng, đầu, cổ và ngực màu lụa, lưng và bên cổ có phớt xám, hông và trên đuôi phớt vàng. Bụng trắng, dưới đuôi vàng họi có vệt lục. Lông cành đen, viền vàng, gốc cánh có vệt tím. Lông đuôi có gốc xám và mút đen. Chim cái trưởng thành không có vệt sáng ở góc cánh, lưng ít xám hơn. Mắt có vòng ngoài vàng cam, vòng trong xanh nhạt. Trước và quanh mắt da trần màu xanh nhạt. Mỏ xanh nhạt, Chóp mỏ xám. Chân đỏ tím. Nơi sống là thích hợp là các kiểu rừng thường xanh.', NULL, 'Việt Nam: Trung và Nam Trung bộ. đã gặp ở Thừa Thiên - Huế vườn quốc gia Bạch Mã Trong những năm gần đây. Thế giới: Miền trung Thái Lan (chỉ quan sát thấy 1 lần) và Lào.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3510, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Treron', NULL, 'GEN_1978', 'treronsphenura', 'Treron sphenura', '(Vigors, 1832)', 'Cu xanh sáo', 'SPA_03535', 'Nó có màu vàng lục với đuôi hình nêm. Vương miện có màu đỏ cam với nhiều đốm màu hạt dẻ trên lưng và vảy ở con đực nhưng không có ở con cái.', NULL, 'Nó được tìm thấy ở Tiểu lục địa Ấn Độ và Đông Nam Á . Nó phân bố khắp Bangladesh , Bhutan , Campuchia , Ấn Độ , Indonesia , Lào , Malaysia , Myanmar , Nepal , Thái Lan , Tây Tạng và Việt Nam .', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3511, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'COLUMBIFORMES', 'BỒ CÂU', 'ORD_024', 'Columbidae', 'Bồ Câu', 'FAM_099', 'Treron', NULL, 'GEN_1978', 'treronvernans', 'Treron vernans', '(Linnaeus, 1771)', 'Cu xanh đầu xám', 'SPA_03536', 'Chim đực trưởng thành: Giống chim đực loài Treron bicincta, chỉ khác là đầu xám nhạt, cằm, họng và cổ màu !ục nhạt tím, dải xám ở các lông đuôi chỉ rộng khoảng 2 mm.\nChim cái: Rất giống loài Treron bicincta nhưng dải xám ở gần mút đuôi hẹp. Mắt: vòng ngoài vàng, vòng trong xanh. Mỏ xám, gốc mỏ xanh. Chân đỏ hơi tím.\nKích thước: Cánh (đực): 146 - 155, (cái): 137 - 153mm.\n ', NULL, 'loài này có ở Khánh Hòa, Ninh Thuận, Biên Hòa, Tây Ninh và Phú Quốc. Cu xanh đầu xám phân bố ở Nam Miến Điện, Mã Lai, Philipin, Campuchia và Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(3512, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Alcedinidae', 'Bói Cá', 'FAM_011', 'Alcedo', NULL, 'GEN_0057', 'alcedoatthis', 'Alcedo atthis', '(Linnaeus, 1758)            ', 'Bồng chanh', 'SPA_03537', 'với bộ lông màu xanh óng ánh. Toàn bộ phần trên của chim: cánh, lưng và đầu hoàn toàn có màu xanh lam. Phần bụng và một mảng nhỏ bên dưới mắt có màu hạt dẻ đậm. Cổ họng và một phần nhỏ bên cổ có màu trắng sáng. Chúng có bàn chân nhỏ màu đỏ. Mỏ của chúng dài, nhọn và khỏe nhằm mục đích bắt và giữ con mồi. Con đực và con cái rất giống nhau ngoại trừ cái mỏ. Mỏ của con đực có màu đen tuyền, trong khi nửa dưới mỏ của con cái có màu hạt dẻ. Con non có màu xanh hơn và xỉn màu hơn con trưởng thành. được tìm thấy trên bờ hồ, ao, suối và vùng đất ngập nước. Chúng thậm chí còn được biết đến là cá ở vùng nước lợ, đặc biệt là trong những tháng mùa đông, khi các vùng nước khác có thể bị đóng băng. Những con chim bói cá thông thường sẽ tìm được bạn tình mới mỗi năm. Giao phối chỉ xảy ra vào những tháng ấm hơn trong năm, bắt đầu từ tháng 4 và đôi khi kết thúc vào cuối tháng 10. Vào khoảng giữa tháng 3, việc làm tổ bắt đầu.', NULL, ' được tìm thấy trên khắp châu Âu và châu Á đến tận phía đông như Nhật Bản. Chúng cũng được tìm thấy ở Châu Phi, phía nam sa mạc Sahara.', NULL, NULL, NULL, NULL, NULL, NULL, 'Animaldiversity'),
(3513, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Alcedinidae', 'Bói Cá', 'FAM_011', 'Alcedo', NULL, 'GEN_0057', 'alcedohercules', 'Alcedo hercules', 'Laubmann, 1917            ', 'Bồng chanh rừng', 'SPA_03538', '23cm. Bộ lông tương tự loài Bồng chanh nhưng phía lưng có màu nâu đen với nhiều điểm nhỏ màu xanh da trời trên lưng và đầu; lông bao cánh xanh da trời; ngực và bụng hung nâu; một dải màu xanh sáng chạy giữa sống lưng tới hông. Mỏ đen, gốc mỏ dưới hơi đỏ ở chim cái. Chân đỏ tươi.', NULL, 'Vùng Tây Bắc (tỉnh Lai Châu, Lào Cai), Bắc và Trung Trung Bộ (tỉnh Hà Tĩnh, Quảng Bình, Quảng Trị và Thừa Thiên Huế).', NULL, NULL, NULL, NULL, NULL, NULL, 'Đỗ Tước và Đặng Thanh Long (2013). Chuyên đề điều tra đa dạng động vật rừng trên địa bàn thành phố Hà Nội. Chi Cục Kiểm lâm Hà Nộ'),
(3514, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Alcedinidae', 'Bói Cá', 'FAM_011', 'Alcedo', NULL, 'GEN_0057', 'alcedomeninting', 'Alcedo meninting', 'Horsfield, 1821.', 'Bồng chanh tai xanh', 'SPA_03539', 'Giống loài bói cá thông thường nhưng nhỏ hơn và có phần trên màu xanh lam đậm hơn (không có tông màu xanh ngọc lam) và bịt tai màu xanh lam. Con đực có mỏ toàn màu đen trong khi con cái có hàm dưới màu đỏ. Con non có tấm che tai màu đỏ và phần lớn là mỏ màu đỏ.  sống: Suối, ao và các vùng nước thích hợp trong hoặc gần khu vực rừng và cây cối rậm rạp. Sinh thái: Làm tổ trong đường hầm bên bờ suối trong rừng.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Birds of Singapore'),
(3515, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Alcedinidae', 'Bói Cá', 'FAM_011', 'Ceryle', NULL, 'GEN_0349', 'cerylelugubris', 'Ceryle lugubris', 'Temminek, 1834', 'Bói cá lớn', 'SPA_03540', 'Là loài có kích thước lớn nhất trong họ Bói cá. Con đực trưởng thành trước mắt, dưới mắt và mào lông ở gáy đen có điểm hình bầu dục trắng. Má, trên cổ và hai bên cổ trắng tạo thành một nửa vòng cổ rộng gần kín ở gáy. Phần còn lại lưng và đuôi nhìn chung có màu đen và trắng xen lẫn nhau tạo thành vằn ngang. Hai vạch đen bắt đầu từ cằm kéo dài xuống dưới và nối với các vệt ở ngực. Nách trắng có vạch đen. Mặt bụng và dưới đuôi trắng. ở giữa ngực có một dải đen rộng lẫn các vệt nâu chia cằm và ngực trên thành hai phần. Chim cái giống tương tự chim đực nhưng dưới cánh và nách phớt nâu hung. Mỏ nâu nhạt, chóp mỏ đen nhạt. Mắt nâu thẫm. Chân xám lục nhạt hay vàng lục nhạt. ', NULL, 'Vùng Đông Bắc, Tây Bắc đến Nam Trung Bộ Ấn Độ, Pakistan, Mianma, Thái Lan, Bắc Đông Dương và Trung Quốc, Triều Tiên và Nhật Bản', NULL, NULL, 'Loài quý hiếm, có giá trị khoa học. Bộ lông nhiều màu sắc và hình dáng đẹp, làm cảnh hấp dẫn.', 'VU', NULL, NULL, 'agriviet.org'),
(3516, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Alcedinidae', 'Bói Cá', 'FAM_011', 'Ceryle', NULL, 'GEN_0349', 'cerylerudis', 'Ceryle rudis', '(Linnaeus, 1758)', 'Bói cá nhỏ', 'SPA_03541', 'loài chim bói cá cỡ trung bình và có kiểu cơ thể đặc biệt của loài bói cá, với đầu to, thân nhỏ, bàn chân nhỏ và mỏ dài như dao găm. Chúng có màu đen và trắng đặc biệt, có đốm trên cánh và có vương miện màu đen trên đầu. Con đực trung bình nặng 82,4 g với chiều dài mỏ là 48,8 mm và con cái trung bình là 86,4 g với chiều dài mỏ là 48,4 mm. Khối lượng cơ thể dao động từ 70 đến 100 g. Giới tính có thể được phân biệt bằng các dải dị hình giới tính trên ngực. Con đực có đặc điểm là có hai dải màu đen trong khi con cái chỉ có một. Chiều dài cơ thể điển hình là 25 đến 29 cm, chiều dài cánh là 13,3 đến 14,2 cm và chiều dài đuôi là 6,6 đến 7,4 cm Chim bói cá sinh sản vào mùa đông ở phần phía bắc và phía nam trong phạm vi phân bố của chúng và sinh sản vào bất kỳ tháng nào gần xích đạo. Con đực và con cái cùng với những con đực khác sẽ chia sẻ nhiệm vụ nuôi chim con và ấp trứng. Tuy nhiên, con cái vẫn là con ấp chính vào ban ngày và thường ấp vào ban đêm. Chim non sẽ được nuôi dưỡng từ 23 đến 26 ngày. sống dọc theo suối, hồ, sông, cửa sông, mương thủy lợi, kênh, vịnh, vùng ngập nước và các vịnh nhỏ có nhiều sậy. Gần khu vực miền núi, họ sống ở các thung lũng sông hạ lưu. Họ thường tránh rừng ngập mặn và đầm lầy lớn.', NULL, ' ở châu Phi cận Sahara, Trung Đông, lục địa châu Á và miền nam Trung Quốc.', NULL, NULL, NULL, NULL, NULL, NULL, 'Animaldiversity'),
(3517, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Alcedinidae', 'Bói Cá', 'FAM_011', 'Ceyx', NULL, 'GEN_0352', 'ceyxerithaca', 'Ceyx erithaca', '(Linnaeus, 1758)', 'Bồng chanh đỏ', 'SPA_03542', 'Đây là loài chim bói cá nhỏ, màu đỏ và vàng, dài trung bình 13 cm, phần dưới màu vàng với phần trên phát sáng màu đen xanh. Môi trường sống ưa thích là những dòng suối nhỏ trong những khu rừng rậm rạp. Nó bắt đầu sinh sản khi có gió mùa Tây Nam vào tháng Sáu. Tổ là một đường hầm nằm ngang dài tới một mét. Một lứa bốn hoặc năm quả trứng sẽ nở trong 17 ngày với cả con đực và con cái ấp. Những con chim này sẽ ra lông sau 20 ngày và lứa thứ hai có thể được nuôi nếu lứa đầu tiên thất bại. Con non được cho ăn tắc kè, thằn lằn, cua, ốc, ếch, dế và chuồn chuồn. Chim bói cá lưng hung đôi khi được coi là một phân loài. ', NULL, ' Nó được tìm thấy ở Bangladesh, Bhutan, Brunei, Campuchia, Ấn Độ, Indonesia, Lào, Malaysia, Myanma, Singapore, Sri Lanka, Thái Lan và Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'Thainationalparks'),
(3518, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Alcedinidae', 'Bói Cá', 'FAM_011', 'Cyex', NULL, 'GEN_0525', 'cyexerycathus', 'Cyex erycathus', NULL, 'Bồng chanh đỏ', 'SPA_03543', 'Một điểm đen ở trán. Đỉnh đầu, phía trên cổ: phần dưới lưng, hông và trên đuôi hung vàng cam có ánh, nhạt là ở hai bền đỉnh đầu và trên đuôi, lông và lưng trên xanh tím. Bao cánh và lông cánh đen, lông cánh sơ cấp có ánh xanh thẫm, phiến lông trong hung tạo thành vệt rộng ở cánh. mỗi bên cổ có một điểm xanh thẫm, phía dưới có một điểm khác màu trắng.\n\nTrước mắt, tai và mặt bụng vàng cam; cằm và họng gần như trắng, sườn, hai bên cổ và ngực phớt hung nhạt. Mép cánh, dưới cánh và nách hung vàng cam. Mắt đỏ tươI, ở chim non mắt nâu. Mỏ và chân dỏ. ', NULL, 'Cao Bằng, Quãng Ninh, Thanh Hóa, Hà Tĩnh và Thủ Dầu Một. Ấn Độ, Xây Lan, Miến Điện, Thái Lan, Đông Dương: Nam Trung Quốc, Mã Lai và Xumatra.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3519, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Alcedinidae', 'Bói Cá', 'FAM_011', 'Halcyon', NULL, 'GEN_0811', 'halcyoncapensis', 'Halcyon capensis', '(Linnaeus, 1766)            ', 'Sả mỏ rộng', 'SPA_03544', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3520, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Alcedinidae', 'Bói Cá', 'FAM_011', 'Halcyon', NULL, 'GEN_0811', 'halcyonchloris', 'Halcyon chloris', 'Sharpe, 1892', 'Sả khoang cổ', 'SPA_03545', 'Chim trưởng thành:\nTrước mắt và một vài lông ở trán đen. Trên phần trước mắt có một vệt vàng nhạt hay trắng kéo dài đến trên mắt, Đầu và gáy xanh lục nhạt. Tai xanh hay xanh lục đôi khi kéo dài thành dải đen hẹp ở sau gáy. Hai bên cổ, vòng cổ rộng ở trước phần trên lưng và toàn bộ măt hung trắng. Lưng trên và vai xanh lục nhạt; lưng dưới, hông và trên đuôi xanh tươi, Đuôi xanh thẫm. Bao cánh xanh, lông cánh tam cấp đen viền xanh trừ lông đầu tiên; lông cánh tam cấp xanh.\nChim non:\nLông ở ngực viền nâu thẫm, đôi khi vòng ở cổ và mặt bụng phớt hung nâu. Mắt nâu thẫm. Mỏ trên và 1/3 ngoài của mỏ dưới đen gốc của mỏ dưới vàng nhạt. Chân đen xám nhạt.\nKích thước:\nCánh: 96 - 107; đuôi: 62 - 65; giò: 15; mỏ: 40 - 47mm. ', NULL, 'Việt Nam gặp loài này từ đèo Hải Vân trở vào các tỉnh Nam bộ như Trà Vinh, An Giang.  phân bố ở Bengan, Axam, Miến Điện, Thái Lan, Nam Đông Dương và Bắc Mã Lai.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3521, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Alcedinidae', 'Bói Cá', 'FAM_011', 'Halcyon', NULL, 'GEN_0811', 'halcyoncoromanda', 'Halcyon coromanda', '(Latham, 1790). ', 'Sả hung', 'SPA_03546', '24cm. Bộ lông màu hung nâu đỏ với mảng bóng màu tím ở lưng. Khi bay thấy rõ lông ở hông màu xanh da trời bóng. sống: Sống ở rừng ngập mặn và các vùng rừng xanh thường gần nguồn nước. Gặp phải khoảng cao 900 mét. Sinh sản trong thời gian từ khoảng tháng 3-7, sinh 4-6 trứng.', NULL, 'Đông Bắc, Bắc và Trung Trung Bộ. ', NULL, NULL, NULL, 'R', NULL, NULL, 'Vietnam Bird Guide'),
(3522, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Alcedinidae', 'Bói Cá', 'FAM_011', 'Halcyon', NULL, 'GEN_0811', 'halcyonpileata', 'Halcyon pileata', '(Boddaert, 1783)', 'Sả đầu đen', 'SPA_03547', '30cm. Dễ nhận biết. Phía lưng có màu xanh da trời thẫm tương phản với đầu đen và khoang cổ, ngực trắng. Bụng màu hung đỏ nhạt. Khi bay thấy rõ mảng trắng lớn ở trên cánh.  sống: Các vùng đất ngập nước, ven biển và ruộng rẫy. Sinh sản vào thời gian từ tháng 4-5, đẻ 4-5 trứng.', NULL, 'Khắp các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3523, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Alcedinidae', 'Bói Cá', 'FAM_011', 'Halcyon', NULL, 'GEN_0811', 'halcyonsmyrnensis', 'Halcyon smyrnensis', '(Linnaeus, 1758)            ', 'Sả đầu nâu', 'SPA_03548', '28cm. Dễ nhận biết. Phía lưng có màu ngọc lam sáng tương phản với đầu màu nâu sô cô la. Họng màu trắng. Bụng cũng có màu nâu sô cô la. Khi bay thấy rõ mảng trắng lớn trên cánh sống: Vùng quang đãng gần nguồn nước. Sinh sản tháng 10-7. Đẻ 3-7 trứng.', NULL, ' Khắp các vùng trong cả nước. Độ cao phân bố đến khoảng 1.500 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3524, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Alcedinidae', 'Bói Cá', 'FAM_011', 'Lacedo', NULL, 'GEN_1010', 'lacedopulchella', 'Lacedo pulchella', '(Horsfield, 1821)', 'Sả vằn', 'SPA_03549', 'Loài chi này phân bố ở các khu rừng thấp nhiệt đới tại Myanmar, Thái Lan, Campuchia, Việt Nam, Lào, Malaysia, Sumatra, Java và Brunei. Loài này đã tuyệt chủng tại Singapore.[1]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/S%E1%BA%A3_v%E1%BA%B1n'),
(3525, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Alcedinidae', 'Bói Cá', 'FAM_011', 'Magaceryle', NULL, 'GEN_1151', 'magacerylelugubris', 'Magaceryle lugubris', '(Temminck, 1834)', 'Bói cá lớn', 'SPA_03550', 'Là loài có kích thước lớn nhất trong họ Bói cá. Con đực trưởng thành trước mắt, dưới mắt và mào lông ở gáy đen có điểm hình bầu dục trắng. Má, trên cổ và hai bên cổ trắng tạo thành một nửa vòng cổ rộng gần kín ở gáy. Phần còn lại lưng và đuôi nhìn chung có màu đen và trắng xen lẫn nhau tạo thành vằn ngang. Hai vạch đen bắt đầu từ cằm kéo dài xuống dưới và nối với các vệt ở ngực. Nách trắng có vạch đen. Mặt bụng và dưới đuôi trắng. ở giữa ngực có một dải đen rộng lẫn các vệt nâu chia cằm và ngực trên thành hai phần. Chim cái giống tương tự chim đực nhưng dưới cánh và nách phớt nâu hung.\n\nMỏ nâu nhạt, chóp mỏ đen nhạt. Mắt nâu thẫm. Chân xám lục nhạt hay vàng lục nhạt. Bói cá lớn đào hang làm tổ nơi vắng vẻ ở các ta luy bên bờ sông, suối. Tổ có đường kính 9 - 11cm làm ở độ cao 3 - 5 hoặc 7m. Miền Bắc Việt Nam gặp tổ có trứng vào tháng 3 - 4. Mỗi lứa đẻ 3 - 4 trứng, vỏ trứng mầu trắng, hình bầu dục tròn. Chim non rời tổ vào tháng 5 và 6. Thức ăn chính là cá nhỏ và vừa.\n\nBói cá lớn sống đơn độc, vào mùa sinh sản sống thành đôi, gặp ở những chỗ gần sông, suối có nhiều cây um tùm ở các miền trung du, miền núi xa nơi dân sinh sống. Chúng rất nhút nhát, khi rình mồi chim rất cảnh giác thường đậu chỗ quang dễ quan sát rộng, chỉ cần hơi động tĩnh hay hơi nghi ngờ là đã nhanh chóng cất cánh bay lẩn tránh đi xa nơi đậu.', NULL, 'Trong nước: Vùng Đông Bắc, Tây Bắc đến Nam Trung Bộ. Thế giới: Ấn Độ, Pakistan, Mianma, Thái Lan, Bắc Đông Dương và Trung Quốc, Triều Tiên và Nhật Bản', NULL, NULL, 'Loài quý hiếm, có giá trị khoa học. Bộ lông nhiều màu sắc và hình dáng đẹp, làm cảnh hấp dẫn.', 'VU', 'VU', NULL, 'vncreatures.net'),
(3526, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Alcedinidae', 'Bói Cá', 'FAM_011', 'Pelargopsis', NULL, 'GEN_1491', 'pelargopsiscapensis', 'Pelargopsis capensis', '(Linnaeus, 1766)', 'Sả mỏ rộng', 'SPA_03551', 'Chim trưởng thành đầu xám nâu nhạt, mặt lưng xanh xỉn, nhưng giữa lưng, hông và trên đuôi xanh da trời. Hai bên cổ, mặt bụng vàng hơi hung. Mắt nâu. Mỏ đỏ (mút mỏ hơi đen). Chân đỏ. Chim non có vằn ở ngực. Thời kỳ sinh sản bắt đầu từ tháng 3 hoặc 2. Làm tổ ở bờ suối hay hốc cây. Sống định cư ở rừng dọc theo bờ sông, suối, có thể lên tới độ cao 1200m. Ngoài ra còn gặp ở đồng bằng, gần ao hồ, cửa sông ven biển và rừng ngập nước.', NULL, 'Việt Nam: Quảng Trị, Thừa Thiên - Huế, Quảng Nam - Đà Nẵng, Gia Lai, Kom Tum, Đồng Nai và Tây Ninh. Thế giới: Mianma, đảo Andaman và Đông Dương.', NULL, NULL, NULL, 'T', NULL, NULL, 'Vncreatures'),
(3527, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Alcedinidae', 'Bói Cá', 'FAM_011', 'Todiramphus', NULL, 'GEN_1965', 'todiramphuschloris', 'Todiramphus chloris', '(Boddaert, 1783)', 'Sả khoang cổ', 'SPA_03552', '24cm. Kích thước nhỏ hơn Sả đầu nâu. Bộ lông có phần trên cơ thể màu xanh da trời hay xanh lá cây, vòng cổ trắng. Không có mảng trắng ở trên cánh khi bay.', NULL, 'Từ Trung Trung Bộ đến Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3528, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Bucerotidae', 'Hồng Hoàng', 'FAM_051', 'Aceros', NULL, 'GEN_0019', 'acerosnipalensis', 'Aceros nipalensis', '(Hodgson, 1829)', 'Niệc cổ hung', 'SPA_03554', '17cm. Bộ lông nhìn chung màu hung và đen; mút lông cánh sơ cấp màu trắng; nửa cuối đuôi màu trắng. Chim trống: Mỏ vàng, không có mũ trên mỏ; túi cổ màu đỏ; đầu, cổ và ngực hung đỏ; bụng màu hạt dẻ', NULL, 'Tây Bắc: Lai Châu (Mường Muôn, Lào Cai (núi Hoàng Liên Sơn, Sa Pa); và Bắc Trung Bộ: Nghệ An (Pù Mát).', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/science-name/rufous-necked-hornbill-662'),
(3529, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Bucerotidae', 'Hồng Hoàng', 'FAM_051', 'Aceros', NULL, 'GEN_0019', 'acerosundulatus', 'Aceros undulatus', '(Shaw, 1811)', 'Niệc mỏ vằn ', 'SPA_03555', 'Con đực trưởng thành mỏ sừng to, trên sống mỏ và gốc mỏ có gờ gợn sóng. Đỉnh đầu mầu nâu tím ở con đực và đen ở con cái. Hai bên đầu và cổ trắng. Họng có túi da mầu vàng cam tươi và có vằn ngang đen ở con đực, xanh ánh vàng ở con cái. Phần còn lại của bộ lông mầu đen, trừ đuôi có mầu trắng. Con đực mỏ trắng ngà, gốc mỏ có màu đỏ, mắt vàng cam hay đỏ, da quanh mắt màu hồng hay vàng đỏ với vằn ngang xanh hay lục. Con cái mắt nâu vùng da quanh mắt mầu hồng thẫm. Đực và cái chân đều màu xám đen. Chim non mới mỏ không có gờ và kích thước bé hơn. Chưa rõ. Kết quả nghiên cứu ở Thái Lan cho thấy loài này sinh sản vào tháng 2 - 5, kéo dài tới 120 ngày. Thời gian ấp 40 - 45 ngày và thường chỉ thấy một con. Thức ăn chủ yếu là các loại quả cây (loại quả thịt) trong rừng, ngoài ra ăn thêm côn trùng chiếm khoảng 5% số lượng thức ăn. Niệc mỏ vằn sống và làm tổ, kiếm ăn ở rừng nguyên, thứ sinh thường xanh ẩm ít bị khai thác ở các thung lũng, vùng đồi núi cao 100-1500m và cả rừng ngập mặn. ở Thái Lan chúng kiếm ăn và làm tổ ở tầng cao của rừng từ 20-28m và vùng hoạt động trong mùa sinh sản rộng khoảng 12km2. Ngoài mùa sinh sản vùng hoạt động kiếm ăn hẹp hơn có bán kính rộng 10km2 và có thể gặp được đàn đông hàng trăm con. Một số khu vực ở miền Trung và Nam Bộ nước ta thường chỉ gặp đàn nhỏ 3 - 5 con. Tuy nhiên, đôi khi có thể gặp đàn lớn đến gần hai chục con.\n', NULL, 'Trong nước: Miền Trung và Nam Bộ Việt Nam. Thế giới: Ấn Độ, Butan, Trung Quốc và Đông nam Á.', NULL, NULL, 'Quý hiếm, có giá trị khoa học và hình dáng đẹp, làm cảnh, thương mại, thực phẩm.', 'VU', NULL, NULL, 'VnCreature'),
(3530, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Bucerotidae', 'Hồng Hoàng', 'FAM_051', 'Anorrhinus', NULL, 'GEN_0109', 'anorrhinustickelli', 'Anorrhinus tickelli', '(Blyth, 1855)            ', 'Niệc nâu', 'SPA_03556', 'Chim trưởng thành có kích thước nhỏ hơn các loài cùng họ Hồng hoàng. Bộ lông nhìn chung có màu nâu đến nâu tối. White Space. Lông lông và lông cánh sơ cấp có đầu trắng. Cằm, hai bên cổ, trước cổ và trên áp sát hung. Mỏ nâu vàng nhạt ở chim đực và nâu ở chim cái; một cú đột kích nhỏ. Da vòng quanh mắt xanh nước biển. Chim không giống chim cái nhưng phần dưới có thể màu nâu xám đậm; lông cánh không có màu trắng. Sống ở sinh cảnh rừng lá rộng xanh, đôi khi rừng rừng giao tiếp với các loài cây rừng lá, rừng thứ sinh; bố trí cao tới 1.500m. Thường xuyên kiếm ăn theo đàn, đôi khi gặp những đàn khác. Mùa sinh sản từ tháng 2 đến tháng 6, chim đực và chim cái cùng xây tổ. Tổ làm trong cây tự nhiên, vật liệu tổng hợp được gắn bằng các mảnh vụn của thức ăn và bột gỗ; tổ cao từ 3,5 - 18 m so với mặt đất; sản xuất 2 - 5 màu trắng, trứng đổi màu trong quá trình ấp.', NULL, 'Trong nước: khắp các vùng rừng trong cả nước. Thế giới: Ấn Độ, Trung Quốc, Mianma, Thái Lan, Lào và Campuchia.', NULL, NULL, 'Người dân địa phương sống gần rừng săn bắn loài này để làm thực phẩm.', 'VU', 'NT', NULL, 'VnCreature'),
(3531, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Bucerotidae', 'Hồng Hoàng', 'FAM_051', 'Anthracoceros', NULL, 'GEN_0118', 'anthracocerosalbirostris', 'Anthracoceros albirostris', '(Shaw & Nodder, 1807)          ', 'Cao cát bụng trắng', 'SPA_03557', 'Chim trưởng thành: Phần dưới ngực, họng, dưới đuôi, phần mút các lông đuôi ngoài, mép cánh, phần gốc và mút các lông cánh sơ cấp, trừ hai lông ngoài cùng và mút các lông cánh thứ cấp trắng. Toàn bộ các phần còn lại của bộ lông đen ánh lục. Mũ trên mỏ hẹp, cao, mút mũ nhọn dô ra về phía trước. Chim càng già mũ càng cao và dài. Hai bên họng có đám da trần. Mắt nâu đỏ. Da trần quanh mắf xanh nhạt hay xanh ánh đỏ. Một đám da ở họng xanh phớt tím. Mỏ vàng nhạt, chóp của mũ có vệt đen. Chim cái: Chỉ khác là có màu mắt nâu, mỏ có nhiều vệt đen hơn ở chóp của mũ, mút của mỏ trên và mép của mỏ dưới. Kích thước: Cánh (đực): 255 - 310, (cái): 235 - 310; đuôi: 225 - 300; giò: 98 - 58; mỏ (đực): 98 - 135, (cái): 92 - 122mm. ', NULL, 'Ở Việt Nam, cao cát bụng trắng có ở hầu khắp các rừng rậm rạp từ Bắc chí Nam. Cao cát bụng trắng phân bố ở Miến Điện, Thái Lan, Đông Dương và Nam Trung Quốc.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3532, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Bucerotidae', 'Hồng Hoàng', 'FAM_051', 'Anthracoceros', NULL, 'GEN_0118', 'anthracocerosmalabaricus', 'Anthracoceros malabaricus', 'Blyth, 1841', 'Cao cát', 'SPA_03558', 'Chim trưởng thành:\nPhần dưới ngực, họng, dưới đuôi, phần mút các lông đuôi ngoài, mép cánh, phần gốc và mút các lông cánh sơ cấp, trừ hai lông ngoài cùng và mút các lông cánh thứ cấp trắng. Toàn bộ các phần còn lại của bộ lông đen ánh lục. Mũ trên mỏ hẹp, cao, mút mũ nhọn dô ra về phía trước. Chim càng già mũ càng cao và dài. Hai bên họng có đám da trần.\nMắt nâu đỏ. Da trần quanh mắf xanh nhạt hay xanh ánh đỏ. Một đám da ở họng xanh phớt tím. Mỏ vàng nhạt, chóp của mũ có vệt đen.\nChim cái:\nChỉ khác là có màu mắt nâu, mỏ có nhiều vệt đen hơn ở chóp của mũ, mút của mỏ trên và mép của mỏ dưới.\nKích thước:\nCánh (đực): 255 - 310, (cái): 235 - 310; đuôi: 225 - 300; giò: 98 - 58; mỏ (đực): 98 - 135, (cái): 92 - 122mm.\nMắt nâu đỏ. Da trần quanh mắf xanh nhạt hay xanh ánh đỏ. Một đám da ở họng xanh phớt tím. Mỏ vàng nhạt, chóp của mũ có vệt đen. ', NULL, 'cao cát bụng trắng có ở hầu khắp các rừng rậm rạp từ Bắc chí Nam. phân bố ở Miến Điện, Thái Lan, Đông Dương và Nam Trung Quốc. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3533, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Bucerotidae', 'Hồng Hoàng', 'FAM_051', 'Anthracoceros', NULL, 'GEN_0118', 'anthracocerosmalayanus', 'Anthracoceros malayanus', '(Raffles, 1822)', 'Cao cát đen', 'SPA_03559', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3534, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Bucerotidae', 'Hồng Hoàng', 'FAM_051', 'Buceros', NULL, 'GEN_0259', 'bucerosbicornis', 'Buceros bicornis', 'Linnaeus, 1758            ', 'Hồng hoàng', 'SPA_03560', 'Đây là loài chim lớn nhất trong họ Hồng hoàng ở Việt Nam. Đầu có giải vàng sáng hoặc đen. Cổ và bụng trắng; giữa cánh có dải rộng trắng; mút cánh trắng; trên đuôi có dải rộng đen. Mỏ lớn màu vàng với mũ mỏ lớn. Da trần quanh mắt đỏ. Chân xám. Chim cái nhỏ hơn chim đực và mỏ cũng nhỏ hơn. Sống định cư và làm tổ trong các vùng rừng rậm kể cả rừng thông nơi có nhiều cây gỗ lớn và ở độ cao đến khoảng 1200m. Thường gặp kiếm ăn ở tầng trên của rừng. Thức ăn chủ yếu là quả cây, thỉnh thoảng bắt gặp chúng ăn các loài thú nhỏ, hay bò sát. Đặc tính sinh sản và làm tổ giống như loài Niệc hung. Con đực kiếm một hốc cây làm tổ đủ lớn để làm tổ và con cái chui vào trong đó đẻ trứng, ấp. Trong suốt thời gian đẻ trứng ấp trứng cho đến khi con non nở. Con đực sẽ kiếm ăn, nuôi con cái cho đến khi con non nở và cùng chui ra. Nếu con đực bị chết thì cả tổ và con cái sẽ chết. Mùa sinh sản từ tháng 1 đến tháng 8, tổ làm bằng phân khô, cùi gỗ và quả, cành thực vật và bùn...Tổ cao cách mặt đất từ 8 - 25 m. Trứng đẻ từ 1 - 3 quả, màu trắng hoặc trắng kem. Sinh cảnh sống là rừng lá rộng thường xanh, rừng hỗn giao với cây rụng lá, rừng trên các đảo lớn, phân bố tới 1.500m.', NULL, 'Trong nước: Rộng khắp các vùng rừng còn tốt trong cả nước. Thế giới: Ấn Độ, Trung Quốc, và các nước Đông nam Á', NULL, NULL, 'Loài chim lớn, mỏ to dùng làm cảnh', 'VU', NULL, NULL, 'VnCreature'),
(3535, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Bucerotidae', 'Hồng Hoàng', 'FAM_051', 'Ptilolaemus', NULL, 'GEN_1683', 'ptilolaemusausteni', 'Ptilolaemus austeni', '(Rasmussen and Anderton, 2005)', 'Niệc nâu', 'SPA_03561', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3536, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Bucerotidae', 'Hồng Hoàng', 'FAM_051', 'Ptilolaemus', NULL, 'GEN_1683', 'ptilolaemustickelli', 'Ptilolaemus tickelli', 'Delacour và Jabouille, 1928.', 'Niệc nâu', 'SPA_03562', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3537, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Bucerotidae', 'Hồng Hoàng', 'FAM_051', 'Rhyticeros', NULL, 'GEN_1751', 'rhyticerosundulatus', 'Rhyticeros undulatus', '(Shaw, 1812)', 'Niệc mỏ vằn', 'SPA_03563', 'Con đực trưởng thành mỏ sừng to, trên sống mỏ và gốc mỏ có gờ gợn sóng. Đỉnh đầu mầu nâu tím ở con đực và đen ở con cái. Hai bên đầu và cổ trắng. Họng có túi da mầu vàng cam tươi và có vằn ngang đen ở con đực, xanh ánh vàng ở con cái. Phần còn lại của bộ lông mầu đen, trừ đuôi có mầu trắng. Con đực mỏ trắng ngà, gốc mỏ có màu đỏ, mắt vàng cam hay đỏ, da quanh mắt màu hồng hay vàng đỏ với vằn ngang xanh hay lục. Con cái mắt nâu vùng da quanh mắt mầu hồng thẫm. Đực và cái chân đều màu xám đen. Chim non mới mỏ không có gờ và kích thước bé hơn. Chưa rõ. Kết quả nghiên cứu ở Thái Lan cho thấy loài này sinh sản vào tháng 2 - 5, kéo dài tới 120 ngày. Thời gian ấp 40 - 45 ngày và thường chỉ thấy một con. Thức ăn chủ yếu là các loại quả cây (loại quả thịt) trong rừng, ngoài ra ăn thêm côn trùng chiếm khoảng 5% số lượng thức ăn.\nNiệc mỏ vằn sống và làm tổ, kiếm ăn ở rừng nguyên, thứ sinh thường xanh ẩm ít bị khai thác ở các thung lũng, vùng đồi núi cao 100-1500m và cả rừng ngập mặn. ở Thái Lan chúng kiếm ăn và làm tổ ở tầng cao của rừng từ 20-28m và vùng hoạt động trong mùa sinh sản rộng khoảng 12km2. Ngoài mùa sinh sản vùng hoạt động kiếm ăn hẹp hơn có bán kính rộng 10km2 và có thể gặp được đàn đông hàng trăm con. Một số khu vực ở miền Trung và Nam Bộ nước ta thường chỉ gặp đàn nhỏ 3 - 5 con. Tuy nhiên, đôi khi có thể gặp đàn lớn đến gần hai chục con', NULL, 'Miền Trung và Nam Bộ Việt Nam. Ấn Độ, Butan, Trung Quốc và Đông nam Á.', NULL, NULL, 'Quý hiếm, có giá trị khoa học và hình dáng đẹp, làm cảnh, thương mại, thực phẩm.', 'VU', NULL, NULL, 'vncreatures'),
(3538, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Cerylidae', 'Bói Cá', 'FAM_070', 'Megaceryle', NULL, 'GEN_1173', 'megacerylelugubris', 'Megaceryle lugubris', '(Temminck, 1834)            ', 'Bói cá lớn', 'SPA_03564', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3539, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Coraciidae', 'Sả Rừng', 'FAM_101', 'Coracias', NULL, 'GEN_0464', 'coraciasbenghalensis', 'Coracias beghalensis', '(Linnaeus, 1758)', 'Sả rừng', 'SPA_03565', 'có màu xanh lam và xanh ngọc. Khi bay, màu xanh lam nhạt và đậm trên cánh và đuôi của nó hiển thị dưới dạng những dải màu rực rỡ. Nó có một cái đầu lớn cái mỏ nặng màu đen. Phần trên của nó có màu nâu và xanh lục, có vệt trắng ở cổ họng và phần bịt tai.  Nó được tìm thấy ở vùng đất trống, được trồng trọt trong và xung quanh các trang trại, và thường gần nơi sinh sống. Nó thường được nhìn thấy một mình hoặc từng cặp riêng biệt đậu trên dây điện báo, cột hoặc cây trơ trụi. Từ trên cao, nó lao vào con mồi, gần như uể oải nhảy dù xuống các loài côn trùng lớn, ếch hoặc thằn lằn. Mùa sinh sản của nó là từ tháng 3 đến tháng 7. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Animaldiversity'),
(3540, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Coraciidae', 'Sả Rừng', 'FAM_101', 'Eurystomus', NULL, 'GEN_0700', 'eurystomusorientalis', 'Eurystomus orientalis', 'Linnaeus, 1766            ', 'Yểng quạ', 'SPA_03566', '30cm. Bộ lông màu đen. Mỏ màu đỏ son tươi. Chim non mỏ nhạt màu hơn. Khi bay thấy rõ mảng vá trên cánh màu xanh ánh bạc. Đậu ở chỗ trống trải, bắt côn trùng trên không. Thường sống đơn độc, thỉnh thoảng có thể gặp nhỏ.  sống: Vùng bìa rừng, thảm rừng thứ sinh, miền đồi núi trung du. Thích sống ở những vùng sườn đồi có cây gỗ. Sinh sản từ khoảng tháng 2-6. Làm tổ ở hốc cây, thỉnh thoảng có thể lợi dụng tổ của Cu rốc, Gõ kiến, đẻ 2-4 trứng.', NULL, 'Khắp các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3541, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Meropidae', 'Trảu', 'FAM_242', 'Merops', NULL, 'GEN_1208', 'meropsleschenaulti', 'Merops leschenaulti', 'Vieillot, 1817', 'Trảu họng vàng', 'SPA_03567', 'Trảu họng vàng là loài có kích thước nhỏ trong họ chim ăn ong (khoảng 21 cm). Chim có đầu và vạch ngang cổ họng hung nâu, phần còn lại của cổ màu vàng nhạt, thân trên xanh lá cây và dưới đuôi xanh da trời nhạt. Chim trống và chim mái giống nhau. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnamwildlife'),
(3542, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Meropidae', 'Trảu', 'FAM_242', 'Merops', NULL, 'GEN_1208', 'meropsorientalis', 'Merops orientalis', 'Latham, 1802            ', 'Trảu đầu hung ', 'SPA_03568', 'Chim trưởng thành:\nĐầu, gáy, sau cổ và lưng trên hung nâu tươi. Giữa lưng, vai và lông bao cánh lục ánh vàng. Lưng dưới, hông và trên đuôi xanh nhạt sáng. Lông cánh lục ánh vàng, mút lông đen. Mặt dưới cánh hung nâu. Đuôi lục ánh vàng, phần kéo dài của các lông đuôi giữa đen, mặt dưới đuôi đen nhạt. Một dải đen bắt đầu từ trước mắt, chạy qua dưới mắt đến phía sau tai, tiếp theo phía dưới là dải xanh nhạt không rõ.\nCằm và họng lục nhạt phớt xanh. Ngang phía trên ngực có dải đen. Ngực lục nhạt phớt vàng. Bụng và dưới đuôi xanh nhạt. Mắt nâu đỏ. Mỏ đen, mút mỏ và gốc mỏ dưới hơi trắng. Chân xám lục.\nKích thước:\nCánh: 89 - 99; đuôi hai bên: 66 - 67, đuôi giữa: 110 - 133; giò: 10 - 11; mỏ: 24 - 30 mm.', NULL, 'Loài trảu này phân bố ở Axam, Miến Điện, Thái Lan, Nam Trung Quốc (Vân Nam) và Đông Dương.Việt Nam: loài này có ở Quảng Trị, Quảng Nam, Quảng Ngãi, Thanh Hóa, Ninh Thuận, Bình Thuận, Lâm Đồng, Biên Hòa, Thủ Dầu Một và Tây Ninh.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3543, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Meropidae', 'Trảu', 'FAM_242', 'Merops', NULL, 'GEN_1208', 'meropsphilippinus', 'Merops philippinus', 'Linnaeus, 1766', 'Trảu ngực nâu', 'SPA_03569', '30cm kể cả lông đuôi. Bộ lông màu xanh, hai cánh có màu xanh đậm và phần lưng trên có màu vàng. Khi bay thấy rõ đuôi màu xanh với các lông đuôi giữa dài; họng vàng; ngực nâu. Chim non không có lông đuôi dài và nói chung là có màu xỉn hơn.', NULL, 'Các vùng trong cả nước (riêng Tây Bắc chưa rõ).', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3544, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Meropidae', 'Trảu', 'FAM_242', 'Merops', NULL, 'GEN_1208', 'meropsviridis', 'Merops viridis', 'Linnaeus, 1758', 'Trảu họng xanh', 'SPA_03570', '28cm kể cả lông đuôi. Bộ lông giống Trảu ngực nâu nhưng họng xanh da trời; đầu, gáy và phần lưng trên màu sô cô la. Khi bay, hông để lộ màu xanh nhạt, tương phản với màu tối của phần thân trên. Chim non không có màu sô cô la, mà có màu xanh lá cây thẫm và không có lông đuôi dài. sống: Những nơi quang đãng ở vùng đồng bằng, ven biển và vùng núi. Có thể gặp đến độ cao khoảng 800 mét. Làm tổ từ khoảng tháng 3-8, đẻ 3-6 trứng.', NULL, 'Khắp các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3545, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Meropidae', 'Trảu', 'FAM_242', 'Nictyornis', NULL, 'GEN_1321', 'nictyornisathertoni', 'Nictyornis athertoni', '(Jardine & Selby, 1828)', 'Trảu lớn', 'SPA_03571', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3546, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Meropidae', 'Trảu', 'FAM_242', 'Nyctyornis', NULL, 'GEN_1345', 'nyctyornisathertoni', 'Nyctyornis athertoni', '(Jardine & Selby, 1830)          ', 'Trảu lớn ', 'SPA_03572', 'Con trưởng thành có chiều dài từ 31 đến 35 cm (12 đến 14 in) và nặng 70 đến 93 g (2,5 đến 3,3 oz). [4] [5] Loài này có mỏ lớn hình liềm và phần đuôi hình vuông không có \"dây\" đặc trưng của những loài ăn ong nhỏ hơn. Con chim có màu xanh cỏ với trán, mặt và cằm màu ngọc lam. Các lông ở cổ họng thon dài tạo nên vẻ ngoài có râu khi chúng xòe ra. Bụng có màu hơi vàng đến ô liu với những vệt màu xanh lá cây hoặc xanh lam. Quần thể người Ấn Độ ở bán đảo được cho là có màu xanh nhạt hơn quần thể người Ấn Độ ở phía đông bắc . [6] Mặc dù con đực và con cái có vẻ ngoài giống nhau, nhưng lông họng màu xanh của con đực cho thấy khả năng phản xạ tia cực tím cao hơn so với con cái. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3547, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CORACIIFORMES', 'SẢ', 'ORD_025', 'Upupidae', 'Đầu Rìu', 'FAM_387', 'Upupa', NULL, 'GEN_2016', 'upupaepops', 'Upupa epops', 'Linnaeus, 1758            ', 'Đầu rìu ', 'SPA_03573', '33cm. Dễ nhận biết. Bộ lông màu hồng nhạt, có nhiều vằn trắng và đen trên cánh, mặt trên đuôi đen có một vằn trắng. Mào lông dài, thường được xếp phẳng dẹt. Tiếng kêu: Tên được đặt theo tiếng kêu ‘hu pu pu’.', NULL, 'Ba Vì', NULL, NULL, NULL, NULL, NULL, NULL, 'Đỗ Tước và Đặng Thanh Long (2013). Chuyên đề điều tra đa dạng động vật rừng trên địa bàn thành phố Hà Nội. Chi Cục Kiểm lâm Hà Nội'),
(3548, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Cacomantis', NULL, 'GEN_0273', 'cacomantismerulinus', 'Cacomantis merulinus', '(Scopoli, 1786)            ', 'Tìm vịt', 'SPA_03574', '22cm. Kích thước nhỏ dễ phân biệt. Thường đậu ở trên cành dưới tán cây cao nên khó thấy. Chim trưởng thành: Đầu màu xám, họng và ngực tương phản với phần trên cơ thể màu xám nâu sẫm và màu nâu đỏ ở phần dưới ngực và bụng. Phần trên đuôi đen nhạt, với nhiều vằn hẹp màu trắng. Thường hay gặp chim cái có bộ lông màu nâu đỏ tối ở phía trên cơ thể và màu xanh nhạt ở phía dưới, toàn thân có vằn; đuôi có vằn dày nổi bật. Chim non: Giống như bộ lông chim cái nhưng nhạt hơn và có đốm trắng ở gáy, trên thân có nhiều vằn.  sống: Thảm cây bụi, nơi canh tác, trong các vườn cây và làng mạc.', NULL, 'Khắp các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3549, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Cacomantis', NULL, 'GEN_0273', 'cacomantissonneratii', 'Cacomantis sonneratii', '(Latham, 1790)            ', 'Tìm vịt vằn', 'SPA_03575', 'Kích thước: 23-24 cm. Con trưởng thành có phần thân trên màu đỏ sẫm với các sọc màu đen, các sọc rất mịn trên toàn bộ phần thân dưới màu trắng và lớp lông tơ rộng màu trắng. Con non giống con trưởng thành nhưng có các vạch màu trắng đến nhạt ở hai bên đầu, vương miện và áo choàng. sống: Rừng, bìa rừng, công viên và vườn.', NULL, '  tìm thấy từ tiểu lục địa Ấn Độ đến miền nam Trung Quốc và Đông Nam Á', NULL, NULL, NULL, NULL, NULL, NULL, 'Birds of Singapore'),
(3550, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Canomantis', NULL, 'GEN_0303', 'canomantismerulinus', 'Canomantis merulinus', 'Scopoli, 1786', 'Tìm vịt', 'SPA_03576', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3551, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Carpococcyx', NULL, 'GEN_0318', 'carpococcyxrenanldi', 'Carpococcyx renanldi', 'Oustalet, 1896', 'Phướn đất', 'SPA_03577', 'Con trưởng thành có đầu, cổ, họng cánh, đuôi màu đen ánh tím. Mặt lưng xám màu tro. Lưng xám nhạt và tận cùng các lông đen nhạt tạo thành vân rất mờ, bụng nhạt hơn gần như trắng. Mỏ đỏ, mắt vàng, da quanh mắt và giò đỏ tím. Phướn đất đi đơn độc hay đôi, sống định cư ở các khu rừng thứ, nguyên sinh thường xanh nhiệt đới ẩm có độ cao dến 900m. Kiếm ăn ở mặt đất, trong các khu vực sườn đồi, thung lũng hẹp có nhiều cây bụi và dây leo râm rạp kín khó quan sát. Thức ăn của Phướn đất là côn trùng các loại. Chim rất cảnh giác khi kiếm ăn, chỉ một tiếng động nhỏ đã lẩn tránh nhanh chóng, đặc biệt là khi gặp nguy hiểm nên khi quan sát phướn đất rất khó khăn. Trong cùng sinh cảnh cũng thường gặp các loài chim khác trong họ Trĩ như các loài Gà lôi, Trĩ sao, Gà rừng, Gà tiền và các loài Gà so...', NULL, 'Thanh Hoá (Như Xuân), Nghệ An (Con Cuông, Quỳ Châu, Quỳ Hợp), Hà Tĩnh (rừng Kẻ Gỗ), Quảng Bình (Phong Nha), Thừa Thiên - Huế (đèo Hải Vân, Bạch Mã, Nam Đông), Quảng Nam (huyện Đại Lộc), Đà Nẵng (Khu bảo tồn thiên nhiên Bà Nà - Núi Chúa). Đông Thái Lan, Lào, Cambodia.', NULL, NULL, 'Đặc sản quý của khu vực, bộ lông có màu sắc đẹp. Có giá trị khoa học, làm cảnh và thương mại.', 'VU', NULL, NULL, 'vncreatures.net'),
(3552, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Centropus', NULL, 'GEN_0339', 'centropusbengalensis', 'Centropus bengalensis', '(Gmelin, 1788)            ', 'Bìm bịp nhỏ', 'SPA_03578', '35cm. Kích thước nhỏ hơn Bìm bịp lớn. Bộ lông có nhiều vằn, cánh màu hạt dẻ, lưng màu nâu (lưng dưới của Bìm bịp lớn có màu đen). Bộ lông chim non khác với chim cái ngoài mùa sinh sản, phần trên cơ thể màu nâu nhạt và phần dưới cơ thể màu nâu sẫm sáng, có nhiều vằn xanh nhạt. Có nhiều bộ lông trung gian giữa chim non và chim trưởng thành. sống: Thảm cây bụi, bìa rừng thứ sinh, thảm cỏ cao và vùng đầm lầy, kể cả rừng tràm. Sinh sản từ tháng 12-10, tổ làm trong bụi rậm, không cao quá so với mặt đất, đẻ 2-4 trứng.', NULL, 'Khắp các vùng trong cả nước. Gặp tới độ cao khoảng 1.800 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3553, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Centropus', NULL, 'GEN_0339', 'centropussinensis', 'Centropus sinensis', '(Stephens, 1815)            ', 'Bìm bịp lớn', 'SPA_03579', '50cm. Bộ lông đen bóng, lông cánh màu hung nâu. Chim non có bộ lông màu nâu, nhiều vằn đa dạng. Thường kêu khi đậu trên các ngọn cây, nhưng phần lớn thời gian đậu trên mặt đất hoặc chui rúc trong các bụi rậm sống: Thảm cây bụi, lau lách và cỏ rậm, rừng thứ sinh, rừng tràm và rừng ngập mặn. Sinh sản từ khoảng tháng 1-8, đẻ 2-5 trứng.', NULL, 'Khắp các vùng trong cả nước. Độ cao phân bố có thể đến 1.500 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3554, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Chrysococcyx', NULL, 'GEN_0399', 'chrysococcyxmaculatus', 'Chrysococcyx maculatus', '(J.F.Gmelin, 1788)            ', 'Tìm vịt xanh', 'SPA_03580', '18cm. Dễ dàng phân biệt chim đực và chim cái khi có tầm nhìn tốt. Khi bay nhìn thấy phía dưới cánh có một dải vằn rộng màu trắng. Chim non bộ lông có màu xanh đồng xám, trên lưng có nhiều vằn nâu đỏ.', NULL, 'Từ Bắc Bộ đến Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/vietnamese-name/asian-emerald-cuckoo-624'),
(3555, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Chrysococcyx', NULL, 'GEN_0399', 'chrysococcyxxanthorhynchus', 'Chrysococcyx xanthorhynchus', '(Horsfield, 1821). ', 'Tìm vịt tím', 'SPA_03581', '22cm. Kích thước nhỏ dễ phân biệt. Thường đậu ở trên cành dưới tán cây cao nên khó thấy. Chim trưởng thành: Đầu màu xám, họng và ngực tương phản với phần trên cơ thể màu xám nâu sẫm và màu nâu đỏ ở phần dưới ngực và bụng. Phần trên đuôi đen nhạt, với nhiều vằn hẹp màu trắng. Thường hay gặp chim cái có bộ lông màu nâu đỏ tối ở phía trên cơ thể và màu xanh nhạt ở phía dưới, toàn thân có vằn; đuôi có vằn dày nổi bật. Chim non: Giống như bộ lông chim cái nhưng nhạt hơn và có đốm trắng ở gáy, trên thân có nhiều vằn. Tiếng kêu: Giống tiếng huýt sáo đều đều 8 âm – 4 âm chậm tiếp đến 4 âm nhanh với cao độ thấp dần. Đôi khi có tiếng kêu ‘pi pou pi-i’. Tiếng kêu lặp đi lặp lại không ngừng, thậm chí suốt cả đêm và ngày. Nghe rõ từ xa, dễ nhận.', NULL, 'Khắp các vùng trong cả nước.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3556, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Clamator', NULL, 'GEN_0424', 'clamatorcoromandus', 'Clamator coromandus', '(Linnaeus, 1766)            ', 'Khát nước', 'SPA_03582', '46cm. Phía lưng có màu đen, gáy trắng, mào lông dài dễ nhận biết, cánh màu hung nâu, khi nhìn thoáng qua dễ nhầm với bìm bịp. Phần dưới cơ thể màu trắng nhạt, họng và ngực trên màu da cam; bao đuôi dưới màu đen. Chim non màu xám xỉn hơn, đuôi ngắn hơn và trên lưng có đốm.  sống: Rừng thường xanh, rừng thứ sinh, vùng tre nứa rậm rạp, bụi rậm, đôi khi gặp ở xung quanh làng bản. Đẻ vào tổ của loài chim khác (khướu).', NULL, 'Vùng Đông Bắc, Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3557, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Cuculus', NULL, 'GEN_0502', 'cuculuscanorus', 'Cuculus canorus', 'Linnaeus, 1758            ', 'Cu cu', 'SPA_03583', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3558, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Cuculus', NULL, 'GEN_0502', 'cuculusfugax', 'Cuculus fugax', 'Horsfield, 1821            ', 'Chèo chẹo nhỏ', 'SPA_03584', 'Toàn bộ mặt lưng xám chì thẫm. Đuôi có mút hung và một dải đen rộng, tiếp theo là một dải hẹp nâu hung nhạt hay xám nhạt và một dải hẹp đen. Lông cánh sơ cấp nâu thẫm, có vằn trắng ở phiến lông trong. Trước mắt xám nhạt, hai bên đầu và cằm xám thẫm. Họng và trước cổ trắng, hơi có vạch xám tro. Phần còn lại của mặt bụng trắng ít nhiều phớt hung. Dưới đuôi trắng.', NULL, 'Chèo chẹo nhỏ phân bố ở Nêpan, Axam, Miến Điện, Bengan, Mã Lai và Alacca.\n\nViệt Nam, loài này có ở các rừng ẩm, rừng thông ở Kontum và Côn Lôn nhưng hiếm.', NULL, NULL, NULL, NULL, NULL, NULL, 'Đỗ Tước và Đặng Thanh Long (2013). Chuyên đề điều tra đa dạng động vật rừng trên địa bàn thành phố Hà Nội. Chi Cục Kiểm lâm Hà Nộ'),
(3559, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Cuculus', NULL, 'GEN_0502', 'cuculusmerulinus', 'Cuculus merulinus', 'Gmelin, 1788.', 'Tìm vịt', 'SPA_03585', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3560, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Cuculus', NULL, 'GEN_0502', 'cuculusmicropterus', 'Cuculus micropterus', 'Gould, 1837            ', 'Bắt cô trói cột', 'SPA_03586', 'Chim đực trưởng thành: Hai bên đầu, đỉnh đầu, hai bên cổ và phía sau cổ xám tro. Trước mắt, cằm và phần trên ngực xám nhạt. Phần còn lại của mặt lưng nâu. Lông cánh sơ cấp có vằn trắng ở phiến lông trong. Lông đuôi có mút trắng và một dãi rộng gần mút đen, thân của các lông đuôi giữa lấm tấm trắng và có mép hung, càng ra các lông đuôi phía ngoài, màu trắng và màu hung càng tăng dần. Mặt bụng trắng đục có vằn đen. Dưới cánh, nách và dưới đuôi cũng tương tự nhưng vằn hẹp hơn.\nChim cái: Tương tự như chim đực nhưng ngực và đôI khi cả cằm và họng phớt hung. Mắt nâu. Mí mắt lục xám nhạt. Mỏ trên nâu đen nhạt, gốc mỏ màu nhạt hơn, mỏ dưới lục nhạt, mép mỏ vàng nhạt. Chân vàng. \nCánh: 169 - 209; đuôi: 137 - 157; giò: 20 - 21; mỏ: 22 - 24mm. ', NULL, 'Việt Nam loài này có ở hầu hết các nơi từ vùng núi rừng đến vùng đồng bằng. Bắt cô trói cột phân bố ở Xây lan, Ấn Độ, Miến Điện, Thái Lan, Đông Dương, đông và Nam Trung Quốc và Triều Tiên. Mùa đông gặp Loài này ở Mã Lai, Xumatra, Java, và Bocnêô.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3561, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Cuculus', NULL, 'GEN_0502', 'cuculussaturatus', 'Cuculus saturatus', '(Blyth, 1843)', 'Cu cu phương đông', 'SPA_03587', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3562, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Cuculus', NULL, 'GEN_0502', 'cuculussparverioides', 'Cuculus sparverioides', 'Vigors, 1832            ', 'Chèo chẹo lớn', 'SPA_03588', 'Đầu, hai bên cổ và mặt lưng xám tro thỉnh thoảng có phớt nâu ở lưng và cánh. Lông cánh sơ cấp có vằn trắng ở phiến lông trong và thỉnh thoảng phớt hung ở phiến lông ngoài. Đuôi có mút trắng và có vằn ngang đen và xám xen kẽ, các vằn đều viền nâu. Trước mắt trắng nhạt. Cằm đen, dãI sau mắt xám. Họng và trước cổ trắng hay xám nhạt lẫn xám thẫm. Ngực phớt hung hay xám. phần còn lạI của mặt bụng trắng, phớt hung và có vằn nâu đen nhạt. Dưới đuôi trắng tinh.', NULL, 'Ba Vì', NULL, NULL, NULL, NULL, NULL, NULL, 'Đỗ Tước và Đặng Thanh Long (2013). Chuyên đề điều tra đa dạng động vật rừng trên địa bàn thành phố Hà Nội. Chi Cục Kiểm lâm Hà Nội'),
(3563, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Endynamis', NULL, 'GEN_0647', 'endynamisscolopacea', 'Endynamis scolopacea', 'Cabanis et Heine (1862 - 1863)', 'Tu hú', 'SPA_03589', 'Khi trưởng thành, chim đực có bộ lông màu đen tuyền ánh xanh thẫm, chim mái lông lốm đốm đen nhạt lẫn trắng bẩn. Chim non lông lúc đầu hoàn toàn đen. Tu hú trưởng thành có sải cánh 19–22 cm, đuôi khoảng 18–20 cm, chân cao 3,5 cm, mỏ 3 cm', NULL, 'Tu hú châu Á sống tập trung ở các vùng đồng bằng và trung du Nam Á, từ Ấn Độ, Sri Lanka, đông nam Trung Quốc, quần đảo Sunda Lớn tới bán đảo Đông Dương và Thái Lan. Mùa rét chim bay từ phương bắc xuống phương nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Tu_h%C3%BA_ch%C3%A2u_%C3%81'),
(3564, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Eudynamys', NULL, 'GEN_0683', 'eudynamysscolopaceus', 'Eudynamys scolopacea', '(Linnaeus, 1758)            ', 'Tu Hú', 'SPA_03590', 'Đây là một loài Chim Cu lớn, đuôi dài 45 cm. Chim trống có màu xanh đen bóng (glossy bluish-black) với một cái mỏ màu xám xanh nhạt (pale greenish grey), mống mắt màu đỏ thẫm, chân màu xám. Chim mái có đầu màu nâu với những sọc màu hung đỏ. Cuống đuôi và lông cánh có màu nâu đậm với với các vệt điểm màu trắng. Bụng màu trắng, nhưng có nhiều sọc. Các phân loài khác khác nhau ở màu sắc và kích thước. Chim non có bộ lông rất giống chim mái và mỏ màu đen Chim Tu Hú thường sống ở những khu rừng thưa nhiều ánh sáng. Chúng hay hót trong mùa sinh sản (tháng ba-tháng tám ở Nam Á), với một loạt những giọng khác nhau. Chim Tu Hú là loài đẻ nhờ, và đẻ một trứng duy nhất của nó trong tổ của nhiều loài chim khác. Chim Tu Hú Châu Á là loài ăn tạp, chúng ăn tất cả các loại côn trùng, sâu bướm, trứng và các động vật có xương sống nhỏ. Chim trưởng thành thức ăn chủ yếu là trái cây', NULL, 'Có ở khắp các vùng đồng bằng và vùng trung du Tu hú phân bố ở Thái Lan, Lào, Campuchia, Việt Nam, Đông nam Trung Quốc và Mã Lai', NULL, NULL, 'Có giá trị khoa học và thẩm mỹ. Là đối tượng nghiên cứu khoa học và giúp cân bằng sinh thái trong tự nhiên', NULL, NULL, NULL, 'VnCreature'),
(3565, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Heirococcyx', NULL, 'GEN_0830', 'heirococcyxspraveroides', 'Heirococcyx spraveroides', '(Vigors, 1832)', 'Chèo chẹo lớn', 'SPA_03591', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3566, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Hierococcyx', NULL, 'GEN_0882', 'hierococcyxfugax', 'Hierococcyx fugar', 'Horsfield, 1821', 'Chèo chẹo nhỏ', 'SPA_03592', 'Chim trưởng thành: Toàn bộ mặt lưng xám chì thẫm. Đuôi có mút hung và một dải đen rộng, tiếp theo là một dải hẹp nâu hung nhạt hay xám nhạt và một dải hẹp đen. Lông cánh sơ cấp nâu thẫm, có vằn trắng ở phiến lông trong. Trước mắt xám nhạt, hai bên đầu và cằm xám thẫm. Họng và trước cổ trắng, hơi có vạch xám tro. Phần còn lại của mặt bụng trắng ít nhiều phớt hung. Dưới đuôi trắng.\nChim non: Mặt lưng nâu, các lông có vằn và viền hung. Mặt bụng trắng có vằn và vạch đen nhạt, ngực ít nhiều phớt hung. Mắt đỏ cam, mí mắt vàng. Mỏ đen xám, gốc mỏ và gần như toàn mỏ dưới lục nhạt, mép mỏ vàng. Chân vàng. Cánh: 178 - 200; đuôi: 141 - 144; giò: 23 - 24; mỏ: 20mm. ', NULL, 'Việt Nam, loài này có ở các rừng ẩm, rừng thông ở Kontum và Côn Lôn nhưng hiếm. phân bố ở Nêpan, Axam, Miến Điện, Bengan, Mã Lai và Alacca.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3567, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Hierococcyx', NULL, 'GEN_0882', 'hierococcyxsparverioides', 'Hierococcyx sparverioides', 'Vigors , 1832           ', 'Chèo chẹo lớn ', 'SPA_03593', '44cm. Kích thước lớn hơn các loài cu cu khác, và có tiếng kêu rất dễ nhận. Ngực màu nâu đỏ thường có đốm với vạch trắng và xám. Chim non có màu nâu đỏ hẹp ở phần trên cơ thể và phần dưới cơ thể màu nâu sẫm với vạch màu nâu đen nhạt. Cánh ngắn hơn, rộng hơn và múp hơn so với Bắt cô trói cột và có thể bị nhầm với loài cắt sống: Các vùng rừng, kể cả rừng ngập mặn.', NULL, 'Khắp các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3568, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Phaenicophaeus', NULL, 'GEN_1513', 'phaenicophaeusdiardi', 'Phaenicophaeus diardi', '(Lesson)', 'Phướn nhỏ', 'SPA_03594', 'Nhìn chung giống phướn nhưng kích thước bé hơn và màu sắc hơi tươi hơn. Phần trước mắt trụi lông nhiều hơn, mặt bụng xám nguyên chất hơn, bụng hơi đen hơn. Mắt đỏ. Mỏ xanh xám, gốc và mép mỏ đỏ. Da trần quanh mắt đỏ tím. Chân đen xám. Cánh: 125 - 136; đuôi: 221 - 229; giò: 32 - 33; mỏ: 29 - 30mm. ', NULL, 'Việt Nam, chỉ mới gặp loài này ỏ vùng rừng Sóc Trăng. Phướn nhỏ phân nhỏ ở Miến Điện, Mã Lai và Xumalra.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3569, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Phaenicophaeus', NULL, 'GEN_1513', 'phaenicophaeusmicropterus', 'Phaenicophaeus micropterus', NULL, 'Bắt cô trói cột', 'SPA_03595', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3570, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Phaenicophaeus', NULL, 'GEN_1513', 'phaenicophaeustristis', 'Phaenicophaeus tristis', '(Lesson, 1830)            ', 'Coọc ', 'SPA_03596', 'Chim trưởng thành:Nhìn chung giống phân loài P. t. longicaudatus, nhưng phần trắng ở mút các lông đuôi có kích thước bé hơn. Phần mút lông trắng của lông đuôi thứ hai kể từ ngoài vào của phân loài longicaudatus dài 23, 9 - 28mm, còn phần đó của phân loài saliens, chỉ dài 21, 7 - 22, 3mm. ', NULL, ' Bắc Việt Nam (từ biên giới Việt - Trung cho đến hết trung Trung bộ). Loài này phân bố ở Bắc Thái Lan, Bắc Lào, Nam Trung Quốc', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3571, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Phoenicophaeus', NULL, 'GEN_1538', 'phoenicophaeustristis', 'Phoenicophaeus tristis', 'Mayer, 1938', 'Phướn', 'SPA_03597', 'Mô tả: 56cm. Đuôi rất dài, mút các lông đuôi trắng. Lông màu xám xanh nhạt, ngực màu xanh nhạt hơn. Mặt đỏ sẫm. Mỏ lớn màu xanh. Không có tập tính gửi trứng vào tổ các loài chim khác; thường đi từng đôi.', NULL, 'Phân bố: Khắp các vùng trong cả nước. Độ cao phân bố đến khoảng 1.600 mét.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/science-name/green-billed-malkoha-137'),
(3572, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Rhopodytes', NULL, 'GEN_1741', 'rhopodytestristis', 'Rhopodytes tristis', '(Lesson, 1830)            ', 'Phướn', 'SPA_03598', 'Nhìn chung giống phân loài P. t. longicaudatus, nhưng phần trắng ở mút các lông đuôi có kích thước bé hơn. Phần mút lông trắng của lông đuôi thứ hai kể từ ngoài vào của phân loài longicaudatus dài 23, 9 - 28mm, còn phần đó của phân loài saliens, chỉ dài 21, 7 - 22, 3mm. ', NULL, 'Bắc Việt Nam (từ biên giới Việt - Trung cho đến hết trung Trung bộ Loài này phân bố ở Bắc Thái Lan, Bắc Lào, Nam Trung Quốc', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(3573, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Sarniculus', NULL, 'GEN_1774', 'sarniculuslugubris', 'Sarniculus lugubris', '(Gray, 1858)', 'Cu cu đen', 'SPA_03599', 'Mô tả: 25cm. Bộ lông đen bóng với nhiều dải vằn trắng ở bao dưới đuôi và lông đuôi ngoài. Trên gáy có mảng trắng nhạt màu trắng và lông trên đùi trắng. Chim non bộ lông có nhiều điểm trắng, đuôi chẻ sâu, mỏ mập hơn. Tiếng kêu: Giống tiếng huýt sáo to, rõ ràng với 4 đến 6 âm tiết cao dần.', NULL, 'Phân bố: Hầu hết các vùng.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/vietnamese-name/drongo-cuckoo-190'),
(3574, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'CUCULIFORMES', 'CU CU', 'ORD_027', 'Cuculidae', 'Cu Cu', 'FAM_108', 'Surniculus', NULL, 'GEN_1884', 'surniculuslugubris', 'Surniculus lugubris', '(Horsfield, 1821)            ', 'Cu cu đen', 'SPA_03600', ' 25cm. Bộ lông đen bóng với nhiều dải vằn trắng ở bao dưới đuôi và lông đuôi ngoài. Trên gáy có mảng trắng nhạt màu trắng và lông trên đùi trắng. Chim non bộ lông có nhiều điểm trắng, đuôi chẻ sâu, mỏ mập hơn. Rừng, rừng thứ sinh, thảm cây bụi và vườn cây, gặp cả ở rừng ngập mặn.  Loài định cư và di cư. Tại vùng Đông Bắc chỉ là loài bay qua trong mùa di cư, không phổ biến, đối với các vùng khác, đây là loài định cư tương đối phổ biến.', NULL, ' Hầu hết các vùng. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3575, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Accipiter', NULL, 'GEN_0015', 'accipiterbadius', 'Accipiter badius', '(Shikra)', 'Ưng xám', 'SPA_03601', '30-36cm. Là loài ưng nhỏ có màu xám sẫm. Thường lao bổ xuống đất từ chỗ đậu để bắt mồi. Chim trưởng thành: Phía lưng màu xám bạc dễ phân biệt (chim cái có màu sẫm hơn), phía bụng màu nâu đỏ với vằn ken dày. Khi bay, phần dưới cánh có màu xám bạc với mút cánh màu tối, nếu nhìn từ trên xuống thì lông ở giữa đuôi Ưng xám không có vằn. Chim non: Phía trên có màu rất sẫm với một sọc ở cổ họng, phần dưới cơ thể có nhiều vạch đậm và vằn; rất giống với Ưng bụng hung non.', NULL, 'Ba Vì', NULL, NULL, NULL, NULL, NULL, NULL, 'Đỗ Tước và Đặng Thanh Long (2013). Chuyên đề điều tra đa dạng động vật rừng trên địa bàn thành phố Hà Nội. Chi Cục Kiểm lâm Hà Nội'),
(3576, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Accipiter', NULL, 'GEN_0015', 'accipitergentilis', 'Accipiter gentilis', '(Linnaeus, 1758)', 'Ưng lớn', 'SPA_03602', '48-61cm (sải cánh rộng 105-130cm). Những đặc điểm phân biệt với các loài ưng khác là Ưng lớn có đầu nổi lên dễ thấy và đuôi dài, gốc đuôi rộng và cuối đuôi xòe tròn (thường xòe ra). Khi bay, thấy cánh đập nhanh sau một vòng lượn; đường viền cong dễ nhìn thấy ở cánh và lông bao dưới đuôi màu trắng nổi bật. Chim mái lớn bằng Diều nhật bản nhưng chim đực chỉ nhỏ gần như Ưng mày trắng cái. Con trưởng thành có một vạch trắng rộng chạy qua mắt và một mảng màu rất sẫm ở mắt. Chim non màu nâu hơn, rất dễ nhầm với Ưng ấn độ ở chỗ đều có vạch trên mắt nổi trội. Vùng có nhiều cây gỗ, những chỗ tương đối trống trải. Phân bố lên đến độ cao khoảng 2.500 mét.', NULL, 'Vùng Bắc Bộ, Nam Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3577, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Accipiter', NULL, 'GEN_0015', 'accipitergularis', 'Accipiter gularis', '(Temminck & Schlegel, 1844)', 'Ưng Nhật Bản', 'SPA_03603', '25-30cm (sải cánh 62-76cm). Kích thước nhỏ hơn nhiều so với Diều hâu (nhỏ hơn Cu gáy). Cánh rất rộng; cánh vỗ rất nhanh và không đều. Di cư theo từng đàn. Chim trống: Phần dưới cơ thể màu vàng đào, mắt đỏ và không có sọc ở họng. Chim mái: Màu nâu sẫm hơn chim đực; sọc đậm ở dưới cánh và đuôi, thường có một sọc dễ nhìn thấy ở họng. Nhìn từ dưới thân thấy màu lông tương phản hơn so với loài Ưng mày trắng tương tự và lông cánh sơ cấp thấy rõ. Chim non: Sọc đậm ở ngực, vệt lông trên mắt nổi bật, sọc ở họng không rõ nét, đỉnh đầu màu vàng hoe, cánh. Rừng, bìa rừng, rừng trồng và khu vực trống trải.', NULL, 'Vùng Đông Bắc, Bắc Trung Trung Bộ, Nam Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3578, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Accipiter', NULL, 'GEN_0015', 'accipiternisus', 'Accipiter nisus', '(Linnaeus, 1758).', 'Ưng mày trắng', 'SPA_03604', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3579, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Accipiter', NULL, 'GEN_0015', 'accipitersoloensis', 'Accipiter soloensis', '(Horsfield, 1821). ', 'ưng lưng đen', 'SPA_03605', 'Nó có thân dài 30–36 cm với con mái lớn hơn con trống. Con trưởng thành có đầu mũi cánh màu đen nổi bật. Con trống ở trên có màu xám, dưới màu trắng và có đôi mắt màu đỏ. Con mái có ngực và dưới cánh màu hung đỏ, và đôi mắt màu vàng. Con chưa trưởng thành có khuôn mặt màu xám, phía trên màu nâu và đôi mắt màu vàng. Chủ yếu ăn ếch, nhưng cũng ăn thằn lằn. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'vi.wikipedia.org'),
(3580, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Accipiter', NULL, 'GEN_0015', 'accipitertrivirgatus', 'Accipiter trivirgatus', '(Temminck, 1824)', 'Ưng ấn Độ', 'SPA_03606', '40-46cm. Giống như Ưng mày trắng nhưng phần lớn có kích thước lớn hơn. Cánh tròn, đuôi dài có vằn. Khi đậu yên, mút cánh chỉ chạm tới gốc đuôi. Khi bay thỉnh thoảng có thể nhìn thấy đầu mút lông bao trên đuôi màu trắng (thỉnh thoảng cụp xuống) và lông bao dưới đuôi mịn màu trắng. Thường đậu ở bìa rừng. Khó quan sát; nhưng có thể tiếp cận gần. Chim trưởng thành: Đầu màu nâu xám mượt, không có vệt lông trên mắt; mào thường chỉ thấy rõ khi đậu. Phần dưới cơ thể có nhiều vạch ở họng và bụng. Chim non: Đầu màu nâu hơn, đỉnh đầu có sọc và vạch ở trên mắt có thể trông thấy rõ rang; bụng trắng với các vết lốm đốm đậm màu.', NULL, ' Các vùng trong cả nước, lên đến độ cao gần 2.000 mét.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3581, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Accipiter', NULL, 'GEN_0015', 'accipitervirgatus', 'Accipiter virgatus', '(Hodgson)', 'Ưng bụng hung', 'SPA_03607', '30-36cm. Bộ lông có một vạch đậm ở họng và phần trên cơ thể màu tối. Khó quan sát vì chim thường kiếm ăn trong các bụi cây rậm rạp ở vùng rừng núi hoặc rừng ngập mặn. Vào sáng sớm thường đậu ở bìa rừng. Kích thước lớn hơn Ưng nhật bản, thường có 3 hay 4 vằn ngang lớn màu tối ở đuôi và phần dưới cơ thể có màu hung. Nhỏ hơn và sẫm màu hơn so với Ưng mày trắng. Chim mái lớn hơn và có màu nâu hơn chim đực, và phía bụng có đốm dễ thấy hơn. Chim non có một vệt sẫm ở ngực. Các vùng rừng lên đến độ cao khoảng 2.000 mét. Làm tổ vào tháng 4-5.', NULL, 'Vùng Tây Bắc, Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3582, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Aquila', NULL, 'GEN_0139', 'aquilaclanga', 'Aquila clanga', '(Pallas, 1811)', 'Đại bàng đen', 'SPA_03608', '66-74cm (sải cánh rộng 155-180cm). Là loài đại bàng có thân hình khỏe, cổ ngắn và đuôi rất ngắn. Sải cánh dài, Đại bàng đen trông như một “Chiếc thảm xác xơ” khi bay trên cao. Tất cả các con Đại bàng đen đều có mảng lông hình chữ U màu trắng ở bao trên đuôi (càng rõ hơn ở chim non). Thường sống ở trên mặt đất. Tiếng kêu ẳng chói tai khi lao từ trên cao xuống. Chim trưởng thành: Toàn thân có màu nâu đen xám tro (đỉnh đầu và gáy không có màu xám bạc), thường là màu đen. Chim non: Có nhiều đốm và vằn trắng dễ nhận thấy ở mặt trên của cánh (do đó có tên tiếng Anh là Spotted eagle-tức đại bàng đốm). Nhìn từ dưới lên, lông bao dưới cánh có màu sẫm rõ hơn so với lông cánh. Chim sắp trưởng thành: Bộ lông có màu sắc đa dạng; hơn 5 năm sau sẽ có bộ lông của chim trưởng thành.', NULL, 'Vùng Đông Bắc và Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/vietnamese-name/greater-spotted-eagle-507'),
(3583, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Aquila', NULL, 'GEN_0139', 'aquilaheliaca', 'Aquila heliaca', '(Savigny, 1809).', 'Đại bàng đầu nâu', 'SPA_03609', '79-84cm. Là loài đại bàng có kích thước lớn, đôi cánh dài, đầu dô và đuôi khá dài. Thường bay vút lên và lượn với đôi cánh bằng hoặc hơi nâng lên. Hay đậu lâu ở nơi cao. Chim trưởng thành: Có màu tối với gáy và đỉnh đầu màu xám bạc; đuôi màu sáng bạc, mút đuôi có màu tối (phía trên) và đặc điểm nhận biết là những “vằn ngang” màu trắng ở hai bên đuôi (khó nhìn thấy). Chim non: Có màu cát nâu nhạt với lông cánh và đuôi có màu tối tương phản, một đám sọc màu tối nổi ngang ở ngực, đường viền cánh màu trắng; phần lưng dưới và phần lưng trên đuôi có một mảng to màu kem. Chim sắp trưởng thành: Dần dần có bộ lông của chim trưởng thành trong vòng hơn 6 năm, trong 3 năm đầu vẫn giữ hình dáng của chim non và sau đó bộ lông trông ố bẩn.', NULL, 'Bắc Bộ, Bắc Trung Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3584, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Aquila', NULL, 'GEN_0139', 'aquilasp', 'Aquila sp', NULL, 'Đại bàng', 'SPA_03610', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3585, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Ariceda', NULL, 'GEN_0158', 'aricedaleucophotes', 'Ariceda leucophotes', '(Dumont, 1820)', 'Diều mào', 'SPA_03611', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3586, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Aviceda', NULL, 'GEN_0190', 'avicedajerdoni', 'Aviceda jecdoni', '(Blyth, 1842)', 'Diều hoa jecdon', 'SPA_03612', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3587, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Aviceda', NULL, 'GEN_0190', 'avicedaleuphotes', 'Aviceda leuphotes', '(Dumont, 1820)', 'Diều mào', 'SPA_03613', '33cm. Bộ lông màu đen và trắng, có mào lông dài thường đứng thẳng ở đỉnh đầu dễ dàng nhận diện. Cánh rộng và bầu với nhiều mảng màu trắng dễ thấy khi nhìn từ trên cao xuống. Khi bay vỗ cánh như loài quạ, thường chỉ bay những quãng ngắn ngay trong tán rừng, thỉnh thoảng nhào lộn. Kiếm ăn lúc hoàng hôn. Đậu ở những nơi quang đãng và ưa thích những chỗ trống trong rừng. Tiếng kêu: Hai tiếng huýt liền nhau cả trong khi bay và đậu. Các vùng rừng, kể cả rừng ngập nước trong đất liền và các sinh cảnh khác trong mùa di trú, gặp lên tới độ cao khoảng 1.500 mét.', NULL, 'Vùng Đông Bắc, Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3588, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Butastur', NULL, 'GEN_0268', 'butasturindicus', 'Butastur indicus', '(J.F.Gmelin, 1788)            ', 'Diều Ấn Độ', 'SPA_03614', '41-49cm (sải cánh 102-115cm). Khi bay giống loài cắt có cánh rộng, đuôi dài. Bộ lông không có các đặc điểm nổi bật. Nhìn từ phía dưới, cổ họng màu trắng với dải rộng màu đen chạy dọc ở giữa tương phản với phần ngực màu hung nâu và đầu màu nâu xám. Mặt dưới cánh màu xám bạc với các mút lông cánh sơ cấp màu sẫm. Chỉ ở giữa đuôi có vằn sát nhau. Phía lưng màu nâu điểm một số nốt trắng ở bao trên đuôi. Khi đậu yên, hai cánh dài gần như chạm vào mút đuôi. Chim non màu hơi trắng, ở phần dưới thân có nhiều đường sọc rộng và đầu có màu trắng nhiều hơn. Bay liệng theo từng vòng với hai cánh ở tư thế bằng.', NULL, 'Các vùng trong nước, trừ khu Tây Bắc.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3589, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Butastur', NULL, 'GEN_0268', 'butasturliventer', 'Butastur liventer', '(Temminck, 1827)', 'Diều xám', 'SPA_03615', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3590, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Buteo', NULL, 'GEN_0269', 'buteobuteo', 'Buteo buteo', '(Linnaeus, 1758)            ', 'Diều Nhật Bản', 'SPA_03616', '54cm (sải cánh rộng 122-137cm). Cánh tròn rộng và đuôi tròn ngắn (thường xòe hình nan quạt) là những đặc điểm phân biệt loài này với Diều hâu. Bay vút lên theo nhiều vòng rộng với đôi cánh giương lên theo hình chữ V tù; thường bay lượn. Đậu ở nơi quang đãng. Màu sắc bộ lông rất đa dạng, nhưng nhìn từ phía dưới, thấy màu lông có mảng đen ở khớp cánh và mút cánh màu sẫm, tương phản với lông cánh sơ cấp có màu trắng. Vùng trống trải, vùng rừng thưa và cửa rừng, khu vực trồng trọt khác.', NULL, 'Đông Bắc, Bắc và Nam Trung Bộ. Phân bố tới độ cao khoảng 3.700 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3591, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Circus', NULL, 'GEN_0416', 'circusaeruginosus', 'Circus aeruginosus', '(Linnaeus, 1758)', 'Diều đầu trắng', 'SPA_03617', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3592, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Circus', NULL, 'GEN_0416', 'circuscyaneus', 'Circus cyaneus', '(Linnaeus, 1766). ', 'Diều ', 'SPA_03618', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3593, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Circus', NULL, 'GEN_0416', 'circusmelanoleucos', 'Circus melanoleucos', '(Pennant, 1769)            ', 'Diều mướp', 'SPA_03619', '42-45cm. Mảnh hơn Diều đầu trắng. Bay lơ lửng với đôi cánh giữ ở vị trí trên đường nằm ngang và (không giống như Diều đầu trắng) thường xuyên lượn với đôi cánh cong như cánh buồm. Chim trống trưởng thành: Khác với Diều đầu trắng là trên vai màu trắng (lông bao cánh). Chim mái trưởng thành: Mặt dưới cánh và phía bụng màu trắng nhạt, có nhiều mảng màu xám nhạt ở lông cánh sơ cấp phía trên, đuôi có vằn ngang (nổi lên 4 hoặc 5 vằn màu đen nhạt). Chim non: Có màu nâu tối, thường phần lưng trên đuôi có mảng trắng rõ nét, đuôi có vằn; nhìn từ dưới lên thấy có màu rất sẫm với nhiều đám màu hung đỏ và xám bạc ở gốc lông cánh sơ cấp. Vùng đồng quê trống trải, đất ngập nước và các cánh đồng lúa.', NULL, 'Vùng Đông Bắc, Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3594, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Circus', NULL, 'GEN_0416', 'circusspilonotus', 'Circus spilonotus', 'Kaup, 1847', 'Diều đầu trắng', 'SPA_03620', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3595, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Elanus', NULL, 'GEN_0633', 'elanuscaeruleus', 'Elanus caeruleus', '(Desfontaines, 1789)            ', 'Diều trắng', 'SPA_03621', '28-35cm. Là loài chim ăn thịt nhỏ có màu trắng và xám tro với hai bên vai cánh màu đen dễ thấy. Đậu ở chỗ cao và trông rất hiền lành. Khi bay liệng, cánh giữ theo hình chữ V dốc đứng; thường xuyên bay lượn. Phần dưới cánh màu trắng với màu đen ở hai bên cho đến lông sơ cấp và kéo dài đến lông thứ cấp ở một số con. Mắt màu đỏ, đuôi vuông. Chim non bộ lông có màu nâu. Vùng trống trải ở rừng, đặc biệt là các vùng rừng tràm ở Nam Bộ, các vùng bán khô hạn và đất ngập nước, và đồng ruộng.', NULL, 'Đến độ cao 1.500 mét. ác vùng trong cả nước, trừ khu Tây Bắc. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3596, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Haliaeetus', NULL, 'GEN_0812', 'haliaeetusleucogaster', 'Haliaeetus leucogaster', 'Gmelin, 1788', 'Đại bàng biển bụng trắng', 'SPA_03622', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3597, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Haliastur', NULL, 'GEN_0813', 'haliasturindus', 'Haliastur indus', 'Boddaert, 1783            ', 'Diều lửa', 'SPA_03623', '43-51cm. Chim trưởng thành: Dễ dàng nhận biết. Chim non: Nhìn chung có màu nâu xám xịt (càng lớn lên càng có màu hung nâu), với mảng trắng dễ nhận thấy ở mặt dưới lông cánh sơ cấp. Khác với Diều hâu ở chỗ đuôi bầu và khác với Diều nhật bản ở chỗ lông cánh thứ cấp có màu đen nhạt, tối hơn nhiều so với đường viền cánh. Vùng rừng trống trải dọc sông và kênh mương gần bờ biển. Các vùng rừng ngập mặn thuộc đồng bằng sông Cửu Long.', NULL, 'Vùng Đông Bắc, Bắc Trung Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3598, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Heiraaetus', NULL, 'GEN_0829', 'heiraaetuskienerii', 'Heiraaetus kienerii', '(G. de Sparre, 1835)', 'Đại bàng bụng hung', 'SPA_03624', 'Chim trưởng thành:\nTrên và hai bên đầu, mặt lưng vai và bao cánh đen hơi có ánh. Bao cánh sơ cấp và lông cánh nâu đen nhạt, lông cánh thứ cấp màu nhạt hơn ở phiến lông trong. Đuôi nâu thẫm có vằn nâu xám nhạt, các lông đuôi giữa gần như đồng màu. Cằm, họng và phần trên ngực trắng, ít nhiều phớt hung, ở giữa ngực và hai bên họng có vạch dài màu đen. Phần dưới ngực, sườn, bụng, đùi và dưới đuôi hung thẫm, ở bụng và sườn có vạch đen. Dưới cánh và nách lẫn lộn giữa hung và đen.\nChim non:\nMặt lưng nâu; mỗi lông đều có viền màu nhạt hơn. Trên mắt có dải lông mày rộng trắng kéo dài lên đến trán. Má và hai bên có vàng lẫn trắng với những vạch đen ở giữa lông. Đuôi nâu thẫm có vằn ngang rộng màu xám và mút hung nâu nhạt. Mặt bụng trắng, đôi khi phớt hung nâu với ít nhiều dải đen. Mắt nâu thẫm. Mỏ xám chì với chóp mỏ đen. Da gốc mỏ vàng. Chân vàng xỉn.\nKích thước:\nCánh (đực): 360 - 380, cái: 405 - 433; đuôi: 204 - 242; giò: 76 - 82; mỏ: 33 - 37 mm. ', NULL, 'loài này rất hiếm và chỉ mới bắt được ở Kontum. phân bố ở phần Đông nam Himalai, Đông nam Ấn Độ, Miến Điện, Mã Lai và Philipin.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3599, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Hieraaetus', NULL, 'GEN_0880', 'hieraaetuskienerii', 'Hieraaetus kienerii', '(G. de Sparre, 1835)', 'Đại bàng bụng hung', 'SPA_03625', 'Chim trưởng thành:\nTrên và hai bên đầu, mặt lưng vai và bao cánh đen hơi có ánh. Bao cánh sơ cấp và lông cánh nâu đen nhạt, lông cánh thứ cấp màu nhạt hơn ở phiến lông trong. Đuôi nâu thẫm có vằn nâu xám nhạt, các lông đuôi giữa gần như đồng màu. Cằm, họng và phần trên ngực trắng, ít nhiều phớt hung, ở giữa ngực và hai bên họng có vạch dài màu đen. Phần dưới ngực, sườn, bụng, đùi và dưới đuôi hung thẫm, ở bụng và sườn có vạch đen. Dưới cánh và nách lẫn lộn giữa hung và đen.\nChim non:\nMặt lưng nâu; mỗi lông đều có viền màu nhạt hơn. Trên mắt có dải lông mày rộng trắng kéo dài lên đến trán. Má và hai bên có vàng lẫn trắng với những vạch đen ở giữa lông. Đuôi nâu thẫm có vằn ngang rộng màu xám và mút hung nâu nhạt. Mặt bụng trắng, đôi khi phớt hung nâu với ít nhiều dải đen. Mắt nâu thẫm. Mỏ xám chì với chóp mỏ đen. Da gốc mỏ vàng. Chân vàng xỉn.\nKích thước:\nCánh (đực): 360 - 380, cái: 405 - 433; đuôi: 204 - 242; giò: 76 - 82; mỏ: 33 - 37 mm.', NULL, 'Đại bàng bụng hung phân bố ở phần Đông nam Himalai, Đông nam Ấn Độ, Miến Điện, Mã Lai và Philipin.\nViệt Nam: loài này rất hiếm và chỉ mới bắt được ở Kontum.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3600, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Icthyophaga', NULL, 'GEN_0949', 'icthyophagahumilis', 'Icthyophaga humilis', '(Muller and Schlegel, 1841)', 'Diều cá bé', 'SPA_03626', 'Đặc điểm nhận dạng:\n\nChim trưởng thành giống như Diều cá lớn nhưng kích thước nhỏ hơn. Phần trên cơ thể và lông bao cánh và ngực màu xám nhạt, đuôi màu xám xịt, dải ngang cuối đuôi màu tối hơn. Phần bụng dưới, đùi và bao dưới đuôi màu trắng. Loài phụ humilis khi bay có thể nhìn thấy gốc của lông sơ cấp trắng. Chim chưa trưởng thành màu xám nhạt hơn, cơ thể có nhiều vân màu sáng và nâu, riêng phần bụng dưới màu trắng.\n\nSinh học, sinh thái:\n\nSinh cảnh sống là các sông và suối lớn trong rừng; có thể gặp ở độ cao tới 900m. Thường đậu rất lâu trên cành cây gần nguồn nước, bay lượn và giữ cánh trên không trung. Định cư ở các vùng phân bố. Mùa sinh sản từ tháng 1 - 4. Tổ lớn, hình cốc sâu, làm tổ trên cây to và cao. Đẻ từ 2 - 3 trứng màu trắng (thường biến màu).', NULL, 'Trong nước: Nghệ An, Hà Tĩnh, Đắk Lắk, Đồng Nai.\n\nThế giới: Ấn Độ, Nêpan, Butan, Trung Quốc, Mianma, Thái Lan, Lào, Cămpuchia, Brunây, Inđônêxia.', NULL, NULL, 'Có giá trị khoa học', 'VU', NULL, NULL, 'vncreatures.net'),
(3601, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Icthyophaga', NULL, 'GEN_0949', 'icthyophagaichthyaetus', 'Icthyophaga ichthyaetus', '(Horsfield, 1821)', 'Diều cá đầu xám', 'SPA_03627', 'Đây là loài chim săn mồi lớn, chắc nịch với mặt trên cơ thể màu nâu sậm, đầu xám, mặt bụng sáng màu và chân trắng. Con non nhạt màu hơn, nhưng có sọc sậm. Nó hay bị lẫn lộn với diều cá bé (Haliaeetus humilis) và đại bàng cá Pallas. Diều cá bé giống về bộ lông nhưng nhỏ hơn, còn đại bàng cá Pallas thì lại lớn hơn, mặt bụng cũng sẫm màu hơn. ', NULL, ' ', NULL, NULL, NULL, 'VU', 'NT', NULL, 'wikiwand'),
(3602, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Ictinaetus', NULL, 'GEN_0950', 'ictinaetusmalayensis', 'Ictinaetus malaiensis', '(Temminck, 1822)', 'Đại bàng Mã Lai', 'SPA_03628', '69-78cm. Là loài đại bàng lớn, màu rất tối, đuôi dài. Săn mồi trên mái rừng. Chim trưởng thành: Toàn thân có màu đen nhạt. Chim chưa trưởng thành: Có màu nâu hơn, đầu màu xám bạc, thân có vạch và nếu nhìn từ dưới lên thì lông bao dưới cánh có màu nhạt hơn.', NULL, ' Các vùng trong cả nước.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3603, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Lophotriorchis', NULL, 'GEN_1106', 'lophotriorchiskienerii', 'Lophotriorchis kienerii', '(G. de Sparre, 1835)', 'Đại bàng bụng hung', 'SPA_03629', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3604, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Milvus', NULL, 'GEN_1233', 'milvusmigrans', 'Milvus migrans', '(Boddaert, 1783)', 'Diều hâu', 'SPA_03630', 'Đầu và cổ nâu hung với thân lông thẫm, Mặt lưng nâu thẫm. Lông bao cánh nhỡ hơi nhạt hơn. Lông bao cánh sơ cấp và lông cánh sơ cấp đen, gốc phiến lông trong có phớt trắng. Các lông cánh sơ cấp trong cùng chuyển dần thành xám như các lông cánh thứ cấp. Đuôi nâu lờ mờ có vằn nâu thẫm. Ngực nâu nhạt. Bụng nâu, mỗi bên có một vệt mờ màu nhạt hơn. Dưới đuôi nâu hung với những vạch đen mảnh ở thân lông. Nách và dưới cánh nâu với thân lông thẫm. Cánh (đực): 420 - 475), (cái): 432 - 499; đuôi: 250 - 289; giò: 49 - 58; mỏ: 32 - 38 ', NULL, 'Miền trung Trung bộ và ở Nam bộ Ấn Độ, Miến Điện, Xâv lan, Đông Dương và Mã Lai', NULL, NULL, 'Có giá trị khoa học và thẩm mỹ. Là đối tượng nghiên cứu khoa học và giúp cân bằng sinh thái trong tự nhiên', NULL, NULL, NULL, 'VnCreature'),
(3605, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Nisaetus', NULL, 'GEN_1329', 'nisaetuscirrhatus', 'Nisaetus cirrhatus', '(Gmelin, 1788)', 'Diều đầu nâu', 'SPA_03631', 'có màu nâu ở trên và màu trắng ở dưới với vệt gần sẫm màu, bụng và ngực có sọc sẫm màu, có các sọc hung nhạt hẹp ở đùi và lớp phủ dưới đuôi, bốn dải sẫm màu trên đuôi và một mào ngắn khác biệt. Hình thái trưởng thành sẫm màu có màu đen với đuôi có màu xám sẫm. Khi bay, mặt dưới cánh có màu xám. Hình thái con non nhợt nhạt có đầu, cổ và phần dưới màu trắng, các tua trắng nổi bật trên các tấm phủ cánh trên, với nhiều dải đuôi sẫm màu hơn. Khi bay, mặt dưới giống với con trưởng thành ngoại trừ thân hình nhạt màu hơn, tấm che cánh và hình đuôi. Hình thái con non có màu sẫm tương tự như con trưởng thành ngoại trừ các vạch sẫm màu ở mặt dưới của lông bay và đuôi.  ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'National Parks Board'),
(3606, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Nisaetus', NULL, 'GEN_1329', 'nisaetuslimnaeetus', 'Nisaetus limnaeetus', '(Gmelin , 1788 )', 'Diều đầu nâu', 'SPA_03632', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3607, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Nisaetus', NULL, 'GEN_1329', 'nisaetusnipalensis', 'Nisaetus nipalensis', 'Hodgson, 1836.', 'Diều núi', 'SPA_03633', '72-80cm (sải cánh 201-115cm). Đây là loài diều có mào dựng nên trông rất khỏe. Thường khó quan sát ở rừng rậm, tuy nhiên thỉnh thoảng có thể gặp ở chỗ trống trải. Khi đậu có thể thấy hai lông dài ở sau gáy. Khi bay thấy có đầu to dô ra và đuôi dài (tương tự Diều ăn ong). Nhìn từ phía lưng, hông có hình móng ngựa và đuôi có vằn ngang, ở con đực trưởng thành lưng màu xám xanh. Nhìn thấy gần ở góc mép mỏ có màu vàng. Chim non có mặt bụng màu xám bạc không rõ, trừ lông cánh thứ cấp màu sẫm và khác với giống Đại bàng má trắng bởi đầu lớn và nhạt màu hơn cùng với hông màu xám bạc. Thường ồn ào. Các vùng rừng núi lên tới độ cao khoảng 2.500 mét.', NULL, 'Bắc Bộ, Bắc và Nam Trung Bộ, Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Birdwatchingvietnam'),
(3608, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Pernis', NULL, 'GEN_1506', 'pernisptilorhynchus', 'Pernis ptilorhynchus', 'Temminck, 1821            ', 'Diều ăn ong', 'SPA_03634', '51-61cm. Bề ngoài giống diều, nhưng có đuôi dài và đầu có dáng giống như chim Bồ câu và đuôi dài. Không giống như chim Ó, khi bay Diều ăn ong thường giữ cánh ở một góc không đổi. Màu sắc có thể khác nhau nhưng hầu hết trên cổ có một vòng màu nâu tối và nhiều vạch ngang nổi rõ ở phía bụng và hai bên má. Chim trưởng thành bộ lông màu xám ở hai bên thân lên đến đầu, mắt tối màu. Lông đuôi có vằn ngang. Mào của Diều ăn ong thường không thấy rõ hoặc không có. Thường ngày kiếm ăn trên mặt đất nhưng cũng có khi săn bắt các loài côn trùng ở trên không. Nhút nhát. Di cư theo từng đàn lớn. Các vùng rừng và các khu vực trồng cây quang đãng. Làm tổ ở nơi thấp khoảng dưới 1.200 mét.\n', NULL, 'Các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3609, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Spilornis', NULL, 'GEN_1845', 'spilornischeela', 'Spilornis cheela', '(Latham, 1790)            ', 'Diều hoa Miến Điện', 'SPA_03635', '51-71cm. Khi bay nhìn thấy rõ từ dưới lên có dải trắng rộng kéo dài dưới cánh và đuôi. Khi bay vút lên cao, hai cánh tạo thành hình chữ V tù. Thường đậu cao trên các cây khô và khi sà xuống đất thì ve vẩy đuôi từ bên này sang bên kia. Đầu có hình khác thường do túm lông trên đỉnh đầu xù lên tạo thành hình mào. Chim non có lông phía bụng màu trắng điểm nhiều chấm đen nhạt, đuôi có vằn sít vào nhau và một số con có một dải vắt ngang ngực trên. Tiếng kêu: Chói tai, vang xa, thường báo hiệu là chúng có hai con. Các vùng rừng núi. Gặp lên tới độ cao gần 2.500 mét. Làm tổ từ tháng 1-10.', NULL, 'Các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3610, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Spizaetus', NULL, 'GEN_1849', 'spizaetuscirrhatus', 'Spizaetus cirrhatus', '(Gmelin, 1788)', 'Diều đầu nâu', 'SPA_03636', ' Chim trưởng thành:\nĐầu, hai bên cổ nâu hung nhạt, không dài quá 25mm, màu đen có chỉ hung. Mặt lưng nâu, mỗi lông đều có phần giữa tbẫm và mép nhạt, lông bao cánh hơi nhạt hơn lưng và vai. Cằm và họng trắng có vệt đen, các vệt này thường tạo thành dải giữa và hai dải hai bên. Ngực và sườn trắng, có vệt rộng màu nâu gụ. Bụng, sườn và dưới đuôi nâu hung, đùi và dưới đuôi còn có vằn trắng. Dưới cánh có vằn nâu thẫm và trắng. Nách nâu xám nhạt với thân lông thẫm.\n\nChim non:\nMặt bụng trắng tuyền. Bộ lông của loài diều này không cố định và thường có những biến dị cá thể. Mắt vàng tươi, mắt chim non nâu. Mỏ xám xanh với chóp mỏ đen. Da gốc mỏ xám chì, ở chim non vàng. Chân vàng xỉn.\nKích thước:\nCánh (đực): 380 - 430 (cái): 405 - 462; đuôi: 280 - 290; giò: 102 - 110 mỏ: 37 - 42mm.', NULL, ' Loài diều này phân bố ở Himalai, Miiến Điện, Mã Lai, Xumatra, Java, Bocnêô, Lào và Cămpuchia.\nViệt Nam chỉ mới bắt được Loài này ở Nha Trang.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5244'),
(3611, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Accipitridae', 'Ưng', 'FAM_002', 'Spizaetus', NULL, 'GEN_1849', 'spizaetusnipalensis', 'Spizaetus nipalensis', '(Hodgson, 1836)', 'Diều núi', 'SPA_03637', '72-80cm (sải cánh 201-115cm). Đây là loài diều có mào dựng nên trông rất khỏe. Thường khó quan sát ở rừng rậm, tuy nhiên thỉnh thoảng có thể gặp ở chỗ trống trải. Khi đậu có thể thấy hai lông dài ở sau gáy. Khi bay thấy có đầu to dô ra và đuôi dài (tương tự Diều ăn ong). Nhìn từ phía lưng, hông có hình móng ngựa và đuôi có vằn ngang, ở con đực trưởng thành lưng màu xám xanh. Nhìn thấy gần ở góc mép mỏ có màu vàng. Chim non có mặt bụng màu xám bạc không rõ, trừ lông cánh thứ cấp màu sẫm và khác với giống Đại bàng má trắng bởi đầu lớn và nhạt màu hơn cùng với hông màu xám bạc. Thường ồn ào. Các vùng rừng núi lên tới độ cao khoảng 2.500 mét.', NULL, 'Bắc Bộ, Bắc và Nam Trung Bộ, Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3612, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Falconidae', 'Cắt', 'FAM_147', 'Aegypius', NULL, 'GEN_0038', 'aegypiuscalvus', 'Aegypius calvus', '(Scopoli, 1786)', 'Ó tai', 'SPA_03638', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3613, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Falconidae', 'Cắt', 'FAM_147', 'Falco', NULL, 'GEN_0710', 'falcoamurensis', 'Falco amurensis', 'Radde, 1863', 'Cắt Amur', 'SPA_03639', '28-31cm. Về hình dáng rất giống các loài cắt, nhưng thường có đuôi dài hơn. Thỉnh thoảng bay lượn và bắt côn trùng trong khi bay. Sống thành đàn. Chim trống: Màu xám sẫm và hung đỏ rất rõ. Nhìn từ phía bụng, phần dưới cánh có màu đen và trắng rõ. Chim mái và chim non: Trông rất giống các loài cắt khác nhưng lông bao dưới cánh trắng hơn, toàn bộ phần trên cơ thể có vằn nhưng mờ, nhiều vạch dưới tai không rõ lắm, chân và gốc mỏ có màu đỏ da cam.', NULL, 'Bắc Bộ. Gặp ở Khu bảo tồn thiên nhiên Xuân Thủy, Nam Định vào tháng 1/2000.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/group/amur-falcon-513'),
(3614, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Falconidae', 'Cắt', 'FAM_147', 'Falco', NULL, 'GEN_0710', 'falcocolumbarius', 'Falco columbarius', 'Linnaeus, 1758', 'Cắt lưng xám', 'SPA_03641', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3615, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Falconidae', 'Cắt', 'FAM_147', 'Falco', NULL, 'GEN_0710', 'falcoperegrinus', 'Falco peregrinus', 'Tunstall, 1771            ', 'Cắt lớn', 'SPA_03642', '38-48cm (sải cánh 84-120cm). Là loài chim cắt lớn nhất Việt Nam. Cánh nhọn và gốc cánh rộng, ở một số tư thế bay giống như hình mỏ neo. Bình thường bay như chim cu, lượn ngắn nhưng khi săn mồi thì rất nhanh nhẹ và có thể lao mạnh đến con mồi. Sự xuất hiện của Cắt lớn luôn luôn gây ra nỗi kinh hoàng trong các đàn chim khác, nó có thể bắt được những con chim có kích thước như vịt. Các khu vực trống trải, kể cả các vùng đất ngập nước và ven biển.', NULL, 'Các vùng trong cả nước. Gặp tại các vùng rừng ngập mặn và đất ngập nước ở Đất Mũi, Cà Mau và Kiên Lương thuộc Kiên Giang vào tháng 3,4 năm 1999. ', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3616, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Falconidae', 'Cắt', 'FAM_147', 'Falco', NULL, 'GEN_0710', 'falcoseverus', 'Falco severus', 'Horsfield', 'Cắt bụng hung', 'SPA_03643', 'Chim trưởng thành: Đầu phía sau cổ và lưng trên gần như đen, hớt xám, màu đen chuyển dần thành xám ở lưng dưới, hông, đuôi, vai và bao cánh, mỗi lông dều có thân lông đen. Các lông đuôi giữa có vằn ngang lờ mờ màu thẫm hơn, ở các chim già các vằn ngang này biến mất và chỉ còn lại một dải đen nhạt ở gần mút. Các lông đuôi hai bên có vằn rõ hơn. Lông cánh sơ cấp đen, ở phiến lông trong có vằn hay điểm hung xám. Lông cánh sơ cấp có điểm lờ mờ. Lông cánh tam cấp xám như lông vai. Hai bên đầu, cằm và họng trắng, phớt hung vàng. Phần còn lại ở mặt bụng hung nâu, hai bên ngực thường có vằn lờ mờ.\nCánh: 215 - 245; đuôi: 95 - 110; giò: 30 - 33; mỏ: 18mm\nChim non: Mặt lưng thẫm hơn, mặt bụng có vệt đen rộng từ ngực cho đến dưới duôi. Mắt nâu. Mỏ xám xanh nhạt, chóp mỏ đen, gốc mỏ màu vàng nhạt. Da gốc mỏ, góc mép mỏ và da quanh mắt vàng chanh. Chân vàng. ', NULL, 'Việt Nam: loài này có ở hầu khằp các vùng núi rừng và trung du từ Bắc bộ đến Nam bộ. Cắt bụng hung phân bố ở đông Ấn Độ, Miến Điện, Thái Lan, Đông Dương, Nam Trung Quốc, Mã Lai, Xumatra, Java và Philipin.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3617, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Falconidae', 'Cắt', 'FAM_147', 'Falco', NULL, 'GEN_0710', 'falcosubbuteo', 'Falco subbuteo', 'Linnaeus, 1758.', 'Cắt trung quốc', 'SPA_03644', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3618, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Falconidae', 'Cắt', 'FAM_147', 'Falco', NULL, 'GEN_0710', 'falcotinnunculus', 'Falco tinnunculus', '(Linnaeus, 1758)            ', 'Cắt lưng hung', 'SPA_03645', '30-35cm (sải cánh 69-74cm). Là loài chim cắt nhỏ có cánh và đuôi rất dài. Thường bay lượn và bổ nhào xuống mặt đất để bắt mồi. Tất cả đều có màu lông ở phần cuối đuôi màu đen, nhưng mút đuôi phớt trắng. Chim mái không có màu nâu sáng của chim đực, nhưng phần trên đuôi một số con chim già có màu nâu. Chim non có màu giống như chim cái nhưng ở phía dưới có nhiều vạch đậm hơn. Các sinh cảnh khác nhau, vùng trồng trọt, khu vực vách đá và cả thành thị.', NULL, 'Đến ở hầu khắp các vùng trong mùa đông. Phân bố tới độ cao khoảng 2.000 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3619, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Falconidae', 'Cắt', 'FAM_147', 'Gyps', NULL, 'GEN_0807', 'gypsbengalensis', 'Gyps bengalensis', '(Gmelin, 1788)', 'Kền kền Măng Gan', 'SPA_03646', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3620, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Falconidae', 'Cắt', 'FAM_147', 'Microhierax', NULL, 'GEN_1220', 'microhieraxcaerulescens', 'Microhierax caerulescens', '(Linnaeus, 1758)', 'Cắt nhỏ bụng hung', 'SPA_03647', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3621, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Falconidae', 'Cắt', 'FAM_147', 'Microhierax', NULL, 'GEN_1220', 'microhieraxmelanoleucos', 'Microhierax melanoleucos', '(Blyth, 1843)            ', 'Cắt nhỏ bụng trắng', 'SPA_03648', '20cm. Là loài cắt nhỏ. Toàn bộ phần trên có màu đen và mặt bụng trắng. Màu lông quanh năm không thay đổi. Thường đậu trên cành cây trụi lá và liệng xung quanh để săn mồi. Bạo dạn đối với người. Thường đi lẻ. Trong các vùng rừng thưa, trống trải và cửa rừng, gặp lên tới độ cao khoảng 1.000 mét. Sinh sản vào tháng 3-5.', NULL, 'Bắc Bộ, Bắc và Trung Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3622, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Falconidae', 'Cắt', 'FAM_147', 'Microhierax', NULL, 'GEN_1220', 'microhieraxsp', 'Microhierax sp.', NULL, 'Cắt nhỏ', 'SPA_03649', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3623, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Falconidae', 'Cắt', 'FAM_147', 'Polihierax', NULL, 'GEN_1599', 'polihieraxinsignis', 'Polihierax insignis', '(Walden, 1872)', 'Cắt nhỏ hông trắng', 'SPA_03650', 'Bộ lông có màu trắng ở phía dưới và trên mông, có những vệt đen trên ngực. Mặt trên của cánh có màu xám đen.  con cái có lớp áo màu hung ở lưng trên và phía sau đầu, trong khi ở con đực những vùng này có màu xám. Đuôi có màu đen, có vạch trắng. Hình dạng của đuôi khá tròn trịa, với các lông ngoài cùng ngắn hơn lông ở giữa một inch. Đôi cánh của nó có hình dạng nhọn đặc trưng của chim ưng, với lông sơ cấp thứ hai dài nhất và lông thứ nhất gần bằng lông thứ ba. Chân và bàn chân của nó có màu vàng. Phần gốc mỏ và vùng da xung quanh mắt có màu vàng. Đầu mỏ có màu xám hoặc màu sừng. môi trường sống tự nhiên của chúng là rừng khô nhiệt đới hoặc cận nhiệt đới và xavan khô. ăn thằn lằn và côn trùng. Nó dùng lỗ trên cây để làm tổ, con cái ấp trứng vào ban ngày. Con cái đẻ một lứa hai quả trứng màu trắng, dài khoảng 35 mm.', NULL, ' Campuchia, Lào, Myanmar, Thái Lan ', NULL, NULL, NULL, NULL, NULL, NULL, 'thainationalparks'),
(3624, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'FALCONIFORMES', 'CẮT', 'ORD_035', 'Pandionidae', 'Ó Cá', 'FAM_270', 'Pandion', NULL, 'GEN_1429', 'pandionhaliaetus', 'Pandion haliaetus', 'Linnaeus, 1758', 'Ó cá', 'SPA_03651', ' 55-61cm. Bộ lông có đầu và cổ màu trắng với một dải rộng màu đen chạy qua mắt tới gáy. Phần dưới cơ thể màu trắng nổi bật với ngực màu tối, lông cánh sẫm màu hơn với những mảng đen ở khớp cánh. Ở phía lưng chim non có nhiều màu lốm đốm. Chúng bay lượn trên mặt nước và lao đầu xuống nước để bắt mồi. Có khi nhìn thấy đang cặp cá. Đậu trên những vật nổi lên ở chỗ nông hoặc trên cây ven bờ. Vùng bờ biển, sông, hồ, các mương máng thủy lợi.', NULL, ' Các vùng trong cả nước trừ Tây Bắc.', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3625, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Arborophila', NULL, 'GEN_0144', 'arborophilabrunneopectus', 'Arborophila bruneopectus', '(Blyth, 1855)', 'Gà so họng trắng', 'SPA_03652', 'Loài có chiều dài 280 mm (11 in), với sải cánh trung bình là 144 mm (5,7 in) đối với con đực và 134 mm (5,3 in) đối với con cái. Chúng thường có đuôi dài 6–7 cm (2,4–2,8 in).  Môi trường sống tự nhiên của loài này là các khu rừng ẩm thấp cận nhiệt đới hoặc nhiệt đới và rừng núi đá nhiệt đới ẩm', NULL, ' Loài này phân bố ở Campuchia, Trung Quốc, Lào, Myanmar, Thái Lan và Việt Nam với khu vực hơn 486.000 kilômét vuông', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3626, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Arborophila', NULL, 'GEN_0144', 'arborophilacharltonii', 'Arborophila charitonii', '(Eyton, 1845)', 'Gà so ngực gụ', 'SPA_03653', 'Loài gà so này có con đực và con cái giống nhau. Nhìn chung mặt trên cơ thể màu nâu thẫm hơi phớt hung, mỗi lông đều có vệt ngang màu đen. Đầu, gáy, cổ có vạch đen hơi dầy nên trông có màu thẫm tối. Họng, hai bên và mặt dưới cổ lông trắng nhạt có điểm đen. Ngực có một dải màu gụ đỏ chạy và vắt ngang qua phần ngực trên; cánh màu nâu hung vàng và có vạch đen. Hai bên sườn màu hung vàng nâu, có vạch đen rõ tạo thành màu đậm hơn. Mặt dưới đuôi màu trắng nhạt. Mỏ vàng lục, gốc mỏ màu đỏ. Mắt nâu, da quanh mắt màu xám có viền đen. chân vàng lục nhạt.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(3627, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Arborophila', NULL, 'GEN_0144', 'arborophilachloropus', 'Arborophila chloropus', '(Blyth, 1859)            ', 'Gà so ngực gụ ', 'SPA_03654', 'Chim trưởng thành: Mặt trên của cơ thể màu nâu thẫm hơi phớt hung, mỗi lông đều có vạch ngang màu đen, ở đầu, gáy và cổ các vạch đen dày làm cho các phần này trông như gần đen. Một dải dài màu trắng có chấm đen chạy qua mắt kéo dài xuống hai bên cổ. Trước cằm, họng màu trắng có điểm đen. Trước cổ và hai bên cổ màu nâu hung vàng có điểm đen. Ngực màu nâu nhạt, hơi hung vàng, có vẳn đen không đều. Bụng trắng phớt hung vàng. Dưới đuôi hung vàng nhạt, thỉnh thoảng có vệt đen. Cánh màu nâu hung và có vạch đen. Hai bên sườn màu hung vàng nâu, có vệt đen to và đậm hơn.\nChim cái: Rất giống chim đực, nhưng nhỏ hơn. Mắt nâu, Da quanh mắt đỏ thẫm. Mỏ vàng, gốc mỏ. Chân vàng.\nKích thước: Chim đực: cánh: 150; đuôi: 70; giò: 38; mỏ: 15; Chim cái: cánh: 141; đuôi: 70; giò: 35; mỏ 16 mmn. ', NULL, 'Chỉ mới bắt được gà so ngực gụ ở trên dãy Trường Sơn thuộc tỉnh Quảng Tri và ở Nam Lào. ', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3628, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Arborophila', NULL, 'GEN_0144', 'arborophiladavidi', 'Arborophila dacidi', 'Delacour, 1927', 'Gà so cổ hung', 'SPA_03655', 'Lông trước mắt đen, có dải rộng mầu trắng nhạt từ trên mắt kéo dài xuống hai bên cổ chuyển thành màu hung vàng. Họng trên trắng, dưới hung vàng, tiếp nối theo là dải màu đen nhìn rất rõ kéo từ sau tai xuống tạo thành yếm ở ngực. Bụng có màu phớt hung vàng nhạt. Sườn có vệt ngang màu đen và trắng xen kẽ nhau. Mỏ đen, gốc mỏ đỏ. Mắt nâu, da trần quanh mắt đỏ. Chân tím nhạt hay hồng. Gà so cổ hung sinh sản vào giữa xuân đến gần cuối hè. Thức ăn của gà so cỏ hung là giun đất, các loại côn trùng cánh cứng và các loại quả cây có thịt mềm và hạt quả cây cỡ nhỏ trong rừng. Có thể gặp Gà so cỏ hung đi thành đàn nhỏ 3 - 5 con ở các sườn đồi, núi rừng (tre, nứa, vầu, lồ ô), rừng hỗn giao tre lẫn cây gỗ rậm rạp, có độ cao 200 - 600m. Ban ngày kiếm ăn ở mặt đất ban đêm bay lên cành cây đậu ngủ.', NULL, 'Trước đây đã tìm thấy ở tỉnh Biên Hoà cũ (Phú Riềng). Nay đã tìm thấy lại ở Vườn quốc gia Cát Tiên (Đồng Nai và Lâm Đồng), vùng rừng Bù Gia Mập (Bình Phước). Cămpuchia.', NULL, NULL, 'Loài đặc hữu quý hiếm, có vùng phân bố hẹp, có giá trị khoa học, làm cảnh. Có ý nghĩa quan trọng đối với việc bảo vệ đa dạng sinh học của Việt Nam và toàn cầu.', 'EU', NULL, NULL, 'vncreatures.net'),
(3629, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Arborophila', NULL, 'GEN_0144', 'arborophilamerlini', 'Arborophila merlini', 'Delacour & Jabouille, 1924          ', 'Gà so Trung bộ', 'SPA_03656', '30 cm. Chim trưởng thành. Mặt trên cơ thể màu nàu thẫm phớt hung; đầu, cổ và gáy có nhiều vạch đen dày. Dải màu trắng có chấm đen chạy qua mắt kéo dài xuống hai bên cổ; trước cằm, họng màu trắng có điểm đen; cổ và hai bên cổ màu hung vàng có điểm đen; ngực nâu vàng; hai bên sờnmàu hung có vệt đen to và đậm. Da quanh mắt đỏ thẫm, mỏ vàng. Chân vàng. Loài này phân bố tại khu bảo tồn thiên nhiên Kẻ Gỗ (Hà Tĩnh) và Vườn quốc gia Bạch Mã, vùng rừng Phong Điền (Thừa Thiên Huế) và Đakrong (Quảng Trị).', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(3630, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Arborophila', NULL, 'GEN_0144', 'arborophilarufogularis', 'Arborophila rufogularis', '(Blyth, 1850)', 'Gà so họng hung', 'SPA_03657', 'Gà gô họng hung dài 26–29 cm (10–11 in). Con đực nặng 325–430 g (11,5–15,2 oz) và con cái nặng 261–386 g (9,2–13,6 oz). Con đực có trán màu xám. Đỉnh và gáy màu nâu ô liu có đốm đen. Có những đường cong siêu lông và ria mép màu trắng. Cổ họng và hai bên cổ có màu đỏ cam, có các đốm đen. Ngực và hai bên sườn có màu xanh xám. Bụng trên có màu xanh xám và bụng giữa màu trắng. Lỗ thông hơi có màu nâu trâu. Lớp áo, lưng và mông có màu nâu ô liu. Các vảy và tấm phủ cánh có các dải màu hạt dẻ, đen và xám. Mỏ có màu nâu sẫm hoặc hơi đen, chân màu hồng hoặc đỏ thẫm. Con cái tương tự như con đực. Chim non ở bên dưới có màu xỉn hơn, vương miện và hai bên sườn của nó có các đường viền màu nâu và đen . Các phân loài có hoa văn khác nhau trên cổ họng của chúng.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3631, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Arborophila', NULL, 'GEN_0144', 'arborophilarunneopectus', 'Arborophila runneopectus', '(Blyth, 1855)', 'Gà so họng vàng', 'SPA_03658', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3632, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Arborophila', NULL, 'GEN_0144', 'arborophilasp', 'Arborophila sp', NULL, 'Gà so sp', 'SPA_03659', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3633, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Arborophila', NULL, 'GEN_0144', 'arborophilatorqueola', 'Arborophila torqueola', 'Valenciennes, 1826            ', 'Gà so họng đen', 'SPA_03660', 'Chim đực trưởng thành:\nĐỉnh đầu màu đỏ nâu tươi, gáy có ít nhiều chấm đen. Một đường hẹp màu đen chạy ngang qua trán, Phần dưới của má và lông mày rộng màu đen, phần lông mày gần phía gáy có pha lẫn màu trắng. Vùng sau mắt vàng hung. Một vệt đỏ nâu lấm chấm đen ở phía dưới lông mày. Mặt lưng màu nâu xám xanh. mỗi lông đều viền đen với hai hoặc ba vạch đen bắt chéo nhau, lông ở hông và trên đuôi có một vệt đen ở giữa và có viền đen hẹp. Các lông đuôi giữa nâu xám xanh có lẫn đen, lông đuôi bên nâu có viền hung đỏ. Vai, bao cánh và lông cánh tam cấp có viền đen và ở giữa lấm chấm màu đen lẫn đỏ nâu.\nLông cánh sơ cấp, và thứ cấp nâu thẫm, những lông ngoài cùng có viền hung đỏ mảnh và những lông cuối cùng có mép phớt hung đỏ và nâu. Cằm, họng, phía trước và phía bên cổ đen, cổ có vạch trắng. Ở góc mép mỏ có dải trắng và một dải trắng khác ngang qua giữa ngực và cổ. Ngực xám, phần giữa bụng trắng. Sườn và bên bụng xám với một vài vệt hoặc vạch trắng ở giữa các lông và vệt đỏ nâu thẫm ở phiến lông trong. Dứới đuôi trắng lẫn đen đen. Mắt nâu. Da trần quanh mắt hồng tía. Mỏ đen. Chân hồng nhạt, phớt xám vàng ở mặt sau.\nChim cái:\nChim cái khác với chim đực ở chỗ, đỉnh đầu nâu xám xanh, điểm đen. Vùng sau mắt nâu, hai bên đầu và toàn bộ hông đỏ hung với những chấm đen ở mút lông. Một mảng trước ngực hung: ngực xám nâu nhạt. Da trần quanh mắt cũng giống như chim đực.', NULL, 'Loài gà so họng đen chỉ mới gặp ở gần Sapa (Lào Cai).', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5285'),
(3634, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Bambusicola', NULL, 'GEN_0201', 'bambusicolafytchii', 'Bambusicola fytchii', 'Anderson, 1871', 'Gà so', 'SPA_03661', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3635, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Coturnix', NULL, 'GEN_0479', 'coturnixchinensis', 'Coturnix chinensis', 'Linnaeus, 1766', 'Cay Trung Quốc', 'SPA_03662', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3636, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Coturnix', NULL, 'GEN_0479', 'coturnixjaponica', 'Coturnix japonica', 'Temminck & Schlegel, 1849          ', 'Cay nhật bản', 'SPA_03663', 'Kích thước nhỏ, mình tròn, đuôi rất ngắn; sống ở vùng đồng cỏ, bất thình lình có thể bay lên từ dưới đất. Khi bay nhìn thấy phía lưng có sọc đậm và màu nâu hơi sẫm tương phản với đường viền phía trong cánh có màu nâu xám. Lông mày nổi bật và hai vệt màu tối ở hai bên cổ là đặc điểm phân biệt loài này với các loài họ Cun cút. Sống ở vùng đồi nơi có cây bụi và cỏ; còn gặp ở rừng thông.', NULL, 'Vùng Đông Bắc, Bắc Trung Bộ, Trung Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3637, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Francolinus', NULL, 'GEN_0723', 'francolinuspintadeanus', 'Francolinus pintadeanus', '(Scopoli, 1786)            ', 'Đa đa', 'SPA_03664', 'Trán, trước mắt và lông mày màu đen. Vùng trên mắt từ mỏ kéo dài qua má ra phía sau cổ là một dải màu trắng. Tiếp phía dưới dải màu trắng là một dải màu đen cũng chạy dài từ mép mỏ ra phía sau cổ. Cằm và họng trắng tuyền. Đỉnh đầu màu hung vàng, ở giữa có một dải đen. Cổ, vai và ngực màu đen có điểm tròn màu trắng. Lưng và hông đen. có vạch trắng. Vai màu hung nâu. Cánh nâu có vệt trắng hung. Ngực và sườn có những vệt trắng tròn, các vệt này to dần và chuyển dần sang, màu hung ở phía sau. Phần dưới đuôi màu nâu hung. Mắt nâu. Mỏ đen hoặc nâu sừng. Chân vàng đất. Chim đực có cựa. Cánh (đực): 135 - l55 (cái): 126 - 145; đuỏi: 75 - 80); giò: 37 - 42; mỏ: 22 - 225 ', NULL, 'Hầu hết các tỉnh ở miền Bắc, miền Trung và miền Nam Đa đa (gà gô) phân bố ở Nam Trung Quốc, Lào, Campucbia, Việt Nam, Thái Lan và một phần Miến Điện', NULL, NULL, 'Đa đa là loài chim săn bắt có giá trị', NULL, NULL, NULL, 'VnCreature'),
(3638, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Gallus', NULL, 'GEN_0733', 'gallusgallus', 'Gallus gallus', '(Linnaeus, 1758)            ', 'Gà rừng ', 'SPA_03665', 'Chim đực trưởng thành: Gần giống Gallus gallus jabouillei, nhưng lông ở cổ thường dài hơn, màu đỏ tươi, mỗi lông có một vệt dọc màu nâu ở giữa lông, mút lông màu da cam.\nChim cái: Khó phân biệt với các phân loài trên. ', NULL, 'Phân loài gà rừng Gallus gallus spadiceus phân bố ở Nam Trung Quốc (Vân Nam). Bắc Miến Điện. Bắc Lào và vùng Tây Bắc Việt Nam. ', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3639, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Lophura', NULL, 'GEN_1107', 'lophuradiardi', 'Lophura diardi', '(Bonaparte, 1856)', 'Gà lôi hông tía', 'SPA_03666', 'Con đực trưởng thành trên đỉnh đầu có mào dài (70 - 90mm) thường dựng hơi chếch về phía sau gáy, màu lam ánh thép. Đầu, cằm và họng màu đen. Phần dưới lưng có màu vàng kim loại. Hông và trên đuôi màu đỏ tía ánh thép, lông bao đuôi dài, lông đuôi dài và cong xuống hình lưỡi liềm. Phần còn lại của bộ lông có màu lam ánh thép. Con cái lông màu nâu, mặt bụng có hình vẩy trắng nhạt, đuôi thẳng và tròn. Da trần ở mặt và chân màu đỏ, mắt nâu đỏ. Chim non trưởng thành bắt đầu sinh sản vào năm thứ ba. Mỗi lứa đẻ 5 - 6 trứng hình bầu dục một đầu to một đầu nhỏ, vỏ trứng màu hung nhạt hay hơi vàng nhạt. Kích thước trứng: 38 x 48mm. Thức ăn của Gà lôi hông tía là các loại hạt, quả cây trong rừng; ngoài ra ăn thêm côn trùng, giun đất. Gà lôi hông tía sống thành đôi hay đàn 3 - 5 con có thể hơn trong các rừng thứ, nguyên sinh, cây bụi, hay ra kiếm ăn ở dọc các đường mòn trong rừng. Giống như các loài trĩ khác ban ngày kiếm ăn ở mặt đất, ban đêm bay lên cây đậu ngủ. Trong cùng sinh cảnh cũng hay gặp gà lôi hông tía kiếm ăn cùng với Gà tiền mặt đỏ, Gà tiền mặt vàng, Gà so ngực gụ, Gà rừng.', NULL, 'Trong nước: Hà Tĩnh, Quảng Bình, Quảng Trị, Thừa Thiên - Huế, Gia Lai, Kontum, Đắk Lắk, Lâm Đồng, Khánh Hoà, Đồng Nai, Tây Ninh Thế giới: Lào, Cămpuchia, Thái Lan', NULL, NULL, 'Loài quý hiếm, chỉ phân bố rộng ở vùng Đông Dương, có giá trị khoa học. Bộ lông có nhiều màu sắc đẹp, làm cảnh.', 'VU', NULL, NULL, 'VnCreature'),
(3640, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Lophura', NULL, 'GEN_1107', 'lophuraedwardsi', 'Lophura edwardsi', '(Oustalet, 1896)', 'Gà lôi lam mào trắng', 'SPA_03667', 'Con đực trưởng thành giống loài Gà lôi lam mào đen, chỉ khác mào lông trên đỉnh đầu màu trắng. Tương tự như vậy loài này khác với loài Gà lôi lam đuôi trắng là chỉ có mào lông ở đỉnh đầu màu trắng chứ không có lông đuôi giữa trắng. Con cái của cả 3 loài đều có da trần ở mặt, giò màu đỏ thẫm (như các con đực), bộ lông màu hung nâu, sự sai khác rất ít nên khó phân biệt ở mỗi loài khi quan sát chúng ngoài tự nhiên. Mùa sinh sản kéo dài từ cuối xuân đến hết mùa thu. Trong nuôi nhốt đẻ vào tháng 8. Mỗi lứa đẻ từ 4 - 7 trứng, vỏ màu hồng nhạt và vàng kem có chấm trắng nhỏ. Thời gian ấp 21 - 23 ngày. Thức ăn chính của Gà lôi lam mào trắng là côn trùng, giun đất, hạt và quả cây trong rừng. Gà lôi lam mào trắng sống đôi hoặc 3 - 5 con ở các vùng rừng thứ, nguyên sinh có độ cao trung bình và thấp 200 - 600m ở vùng phía đông dãy Trường Sơn của vùng Trung Bộ nước ta. Ban ngày kiếm ăn ở mặt đất, ban đêm bay lên cành cây đậu ngủ.', NULL, 'Trong nước: Quảng Bình, Quảng Trị, Thừa Thiên - Huế ( huyện Phong Điền, Hải Lăng và A Sầu- A Lưới) hế giới: Chỉ có ở Việt Nam.', NULL, NULL, 'Loài đặc hữu của Việt Nam, quý hiếm, làm cảnh, thương mạị, có tầm quan trọng quốc tế đặc biệt đối với việc bảo vệ đa dạng sinh học.', 'EN', NULL, NULL, 'VnCreature'),
(3641, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Lophura', NULL, 'GEN_1107', 'lophurahatinhensis', 'Lophura hatinhensis', 'Vo Quy et al., 1975', 'Gà lôi lam đuôi trắng', 'SPA_03668', 'Đặc điểm nhận dạng:\nGà lôi lam đuôi trắng giống loài Gà lôi lam mào trắng chỉ khác là có 4 lông đuôi ở giữa màu trắng tuyền ở con đực và cái. Trong nuôi nhốt ở Vườn thú Hà Nội có vài cá thể đực có tới 7 lông đuôi giữa trắng.\nSinh học, sinh thái:\nMùa sinh sản của gà lôi lam đuôi trắng kéo dài từ tháng 2 - 7. Tìm thấy 3 chim non rời tổ vào ngày 6/6/1987 (Trương Văn Lã). Quan sát thấy 4 con rời tổ vào 6/1994 ở vùng ranh giới phía nam tỉnh Hà Tĩnh (Kỳ Anh) và Quảng Bình (Tuyên Hoá), đồng thời thu một mẫu con đực ở gần xóm Trung Thành xã Kỳ Thượng (Kỳ Anh) và gặp một con đực khác cùng địa điểm ngủ đêm trên cây gỗ nhỏ cao 5-6 m vào lúc sáng sớm (Nguyễn Cử, 1994). Gà lôi lam đuôi trắng, nuôi ở Vườn thú Hà Nội kéo dài từ tháng 2 - 7, đẻ và ấp trứng từ tháng 2 - 4. Mỗi lứa đẻ 5 - 7 trứng hình bầu dục, đầu to đầu nhỏ, vỏ trứng màu hồng nhạt hay hung nâu (ca cao), có nhiều chấm trắng nhỏ. Thời gian ấp là 22 - 23 ngày (Đặng Gia Tùng 1998).\n Giống các loài Gà lôi khác, Gà lôi lam đuôi trắng ăn các loại quả, hạt quả, lá, mầm non một số loại cây trong rừng. Ngoài ra chúng ăn thêm giun đất, ốc nhỏ, nhiều loài côn trùng. Theo Đặng Gia Tùng (1998), Gà lôi lam đuôi trắng nuôi tại Vườn thú Hà Nội thích ăn ngô hạt, thóc hạt, cơm, lạc hột, chuối tiêu chín, nho qủa, rau xà lách, giá đỗ xanh và châu chấu, giun đất, con ốc vặn, thịt lợn nạc...\nGà lôi lam đuôi trắng sống đôi hoặc đàn nhỏ 3 - 5 con và có thể hơn ở các sườn đồi thấp và thung lũng ven suối có độ cao 50 - 200m, nơi có rừng nguyên, thứ sinh, rừng hồi phục sau khai thác ở mức độ khác nhau, dưới tán rừng hỗn giao (cây cọ, lá nón, song mây, tre, nứa thấp mọc thưa). Có thể gặp ở rừng trồng cây mỡ (Manglitia glauca) ở khu vực Cát Bịn huyện Cẩm Xuyên (Hà Tĩnh). Trong cùng sinh cảnh còn gặp một số loài Chim trĩ khác như Trĩ sao, Gà lôi trắng, Gà lôi hông tía, Gà tiền mặt vàng, Gà so họng vàng và Gà so ngực gụ... Ban ngày kiếm ăn ở mặt đất, ban đêm bay lên cành cây đậu ngủ.', NULL, 'Trong nước: Hà Tĩnh (Hương Khê, Cẩm Xuyên, Kỳ Anh), Quảng Bình (Tuyên Hóa, Minh Hóa).', NULL, NULL, 'Loài quý hiếm đặc hữu của Việt Nam có phân bố hẹp ở vùng bắc Trung Bộ. Có giá trị khoa học cao.', 'EN', NULL, NULL, 'vncreatures.net'),
(3642, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Lophura', NULL, 'GEN_1107', 'lophuraimperialis', 'Lophura imperialis', '(Delacour et Jabouille, 1924)', 'Gà lôi lam mào đen', 'SPA_03669', 'Đặc điểm nhận dạng:\nCon đực trưởng thành có màu xanh lam thẫm. Mào lông ở gáy màu lam đen. Lưng, cánh và đuôi màu đen, mép lông màu lam ánh thép. Hai lông đuôi ở giữa nhọn, dài và ngắn dần ở các đôi tiếp theo 2 bên. Da trần quanh mặt đỏ tía, tạo thành thuỳ nhỏ ở hai bên trán. Mắt màu đỏ da cam, mỏ màu lục vàng nhạt hay màu sừng, chân đỏ tía. ở con đực non gần tuổi thành thục có bộ lông màu nâu tối, nhiều chỗ có vân mảnh trắng ngà, đầu, mào, cổ và ngực màu lam đen. Con cái trưởng thành không có mào rõ ràng. Bộ lông nhìn chung có màu nâu hạt dẻ. Các phần khác có màu tương tự như ở con đực.\nSinh học, sinh thái:\nTrong nuôi nhốt chim đẻ vào tháng 6, mỗi lứa đẻ 5 - 7 trứng vỏ trứng màu kem hay hồng thẫm với các chấm trắng nhỏ. Thời gian ấp 25 ngày. Cũng như các loài Gà lôi khác, Gà lôi lam mào đen ăn côn trùng, các loại hạt, quả cây trong rừng.\nGà lôi lam mào đen được tìm thấy đầu tiên trên thế giới ở khu vực rừng xanh ẩm trên núi đá vôi giữa tỉnh Quảng Bình và Quảng Trị. Mẫu chim đực non tìm thấy vào tháng 9 năm 1990, ở rừng thứ sinh trên độ cao 50 - 200m thuộc vùng nam tỉnh Hà Tĩnh (huyện Kỳ Anh) và cũng có khả năng vùng Khe Nét (Tuyên Hoá, Quảng Bình). Cũng như các loài trĩ khác, gà lôi lam mào đen ban ngày kiếm ăn ở mặt đất ban đêm bay lên cây đậu ngủ. Trong cùng sinh cảnh còn gặp các loài trĩ khác như Trĩ sao, Gà tiền mặt vàng, Gà lôi trắng, Gà so ngực gụ, Gà rừng...', NULL, 'Trong nước: Vùng phân bố lịch sử là Quảng Bình, Quảng Trị. Vùng phân bố mới phát hiện ở phía Nam tỉnh Hà Tĩnh (vùng rừng Khe Nét, thượng nguồn sông Gianh thuộc huyện Kỳ Anh), Quảng Bình (huyện Tuyên Hoá).\nThế giới: Theo Delacour et al (1931) có khả năng ở Lào, dọc theo biên giới gần với khu phân bố nói trên.', NULL, NULL, 'rất hiếm, có vùng phân bố hẹp, do đó có ý nghĩa quan trọng đối với việc bảo vệ đa dạng sinh học toàn cầu.', 'CR', NULL, NULL, 'vncreatures.net'),
(3643, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Lophura', NULL, 'GEN_1107', 'lophuranycthemera', 'Lophura nycthemera', '(Linnaeus, 1758)            ', 'Gà lôi trắng ', 'SPA_03670', 'Chim đực trưởng thành của 5 phân loài Gà lôi trắng có đặc điểm sai khác đặc trưng là càng vào phía nam của vùng phân bố lông đuôi của chúng càng ngắn dần, màu trắng của bộ lông cũng giảm và màu đen tăng lên. Bộ lông có vằn đen trắng xen lẫn thể hiện rất rõ ở phân loài đặc hữu Gà lôi vằn lưng (Lophura nycthemera annamensis) phân bố ở rừng nam Trung Bộ đến đông bắc Nam Bộ (Việt Nam). Lông đuôi của phân loài beli (Lophura nycthemera beli) có màu trắng rõ hơn so với phân loài berli (Lophura nycthemera berliozi) mặc dù hai phân loài này có hình thái ngoài tương tự nhau. Sinh sản của gà lôi trắng từ cuối mùa xuân kéo dài đến cuối mùa hè. Con đực thường khoe mẽ vào tháng 2, làm tổ và đẻ trứng vào tháng 4 - 5. Mỗi lứa đẻ 5 - 10 trứng, vỏ trưng màu trắng ngà hay hung nhạt. Thời gian ấp 25 - 26 ngày. Cũng như các loài gà lôi khác thức ăn của gà lôi trắng là côn trùng, giun đất, các loại hạt và quả cây trong rừng. Tuỳ từng phân loài, gà lôi trắng sống đôi, đàn nhỏ 3 - 5 con hoặc nhiều hơn đến 10 con như ở trĩ bạc. Nơi sống thích hợp của gà lôi trắng là các loại rừng thường xanh nguyên, thứ sinh và rừng hồi phục, rừng khai thác ẩm rậm rạp, nơi có độ cao 300m trở lên so với mặt biển. Đã gặp loài này ở độ cao trên các đỉnh núi cao 1200 - 1800m. Ban ngày kiếm ăn trên mặt đất ban đêm bay lên trên cành cây đậu ngủ.', NULL, 'Trong nước: Từ Bắc bộ vào đến Nam Bộ. Thế giới: Nam Trung Quốc, Mianma, Thái Lan, Lào, Cămpuchia. Tùy từng phân loài, riêng các phân loài L. n. beli và L. n. annamemsis là đặc hữu của Việt Nam', NULL, NULL, 'Gà lôi trắng đặc biệt là các phân loài L. n . annamensis, L. n. beli có giá trị thẩm mỹ và đa dạng sinh học cao.', 'LR', NULL, NULL, 'VnCreature'),
(3644, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Pavo', NULL, 'GEN_1488', 'pavomuticus', 'Pavo muticus', 'Linnaeus, 1766            ', 'Công, Cuông', 'SPA_03671', 'Nhìn chung bộ lông ở con đực trưởng thành có màu lục ánh thép. Đuôi dài, lông bao đuôi trên phát triển thành lông trang hoàng dài tới 1500mm, màu lục ánh đồng, lúc xoè ra có hình nan quạt thẳng đứng. Con cái có màu sắc tương tự con đực, chỉ khác là đuôi ngắn hơn và không có lông trang hoàng. Mỏ xám sừng. Mắt nâu, da quanh mặt vàng xanh. Giò xám thẫm ánh xanh. Con đực và cái đều có cựa, nhưng ở con đực phát triển hơn con cái. Công làm tổ đơn giản ngay trên mặt đất ở nơi kín đáo nhưng khô, thoáng. Thời gian đẻ vào tháng 5 – 6, mỗi lứa đẻ 3 – 5 trứng hình bầu dục, một đầu to, một đầu nhỏ. Công nuôi ở Vườn thú Hà Nội đẻ 6 quả (Đặng Gia Tùng, 1998). Nuôi ở Suối Hai, Ba Vì đẻ tới 10 quả, vỏ trứng màu hung nhạt. Kích thước trung bình (77,6 x 56,3mm), thời gian ấp là 24 – 25 ngày (Trương Văn Lã, 1997). Thức ăn chủ yếu là các loại quả cây, hạt ngũ cốc, hạt cỏ dại, nhiều loại côn trùng trong đó chúng thích nhất là cào cào, châu chấu, giun đất và ngoé, nhái. Mùa thay lông vào tháng 6 và tháng 11 trong năm.', NULL, 'Vùng Hà Tĩnh (Khe Bưởi, hồ Kẻ Gỗ), Quảng Nam, Phú Yên, Khánh Hoà ( Diên Khánh), Gia Lai, Kontum, Đắk Lắk, Lâm Đồng, Bình Phước ( Bù Gia Mập), Đồng Nai (Vườn Quốc gia Cát Tiên).  hế giới: Đông Mianma, Trung Quốc (Nam Vân Nam), Lào, Cămpuchia, Thái Lan.', NULL, NULL, 'Chim có bộ lông và hình dáng đẹp nên đã trở thành chim cảnh từ lâu ở nhiều nước trên thế giới và có giá trị khoa học, thương mại …', 'EN', NULL, NULL, 'Agriviet'),
(3645, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Phasianus', NULL, 'GEN_1524', 'phasianuscolchicus', 'Phasianus colchicus', 'Linnaeus, 1758', 'Trĩ đỏ', 'SPA_03672', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3646, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Polyplectron', NULL, 'GEN_1603', 'polyplectronbicalcaratum', 'Polyplectron bicalcaratum', 'Linnaeus, 1758            ', 'Gà tiền mặt vàng ', 'SPA_03673', 'Gồm 2 phần loài Polyplectron bicalcarratum bicalcaratum (Linnaeus, 1758),  Polyplectron bicalcarratum ghigii Delacour và Jabouille, 1924. Chim đực trưởng thành nhìn tổng thể bộ lông màu xám tro hơi nâu. Da quanh mặt vàng phớt hồng. Đỉnh đầu có lông xù lên tựa như mào thấp, màu hơi vàng trắng. Hông, phần trước cổ nâu trắng nhạt. Phía sau cổ, ngực có những vệt trắng rõ. Lưng, phao câu và lông bao đuôi cũng có những vệt trắng xếp thành hàng ngay ngắn, nhưng nhạt mờ hơn ngực. Trên cánh có những sao tròn màu xanh lam óng ánh. Lông đuôi cũng có những sao dạng bầu dục màu lục xanh biếc. Mỗi đôi sao được xếp theo hàng ngang. Chim cái tương tự như chim đực nhưng cỡ nhỏ hơn, lông xỉn hơn. Da mặt màu hồng thịt. Màu trắng của mào, lông ở gáy và họng không rõ lắm. Những sao trên cánh nhỏ và đen hơn, ánh sao không rõ bằng ở chim đực. Trên các lông đuôi ngắn nhất không có sao. Mỏ đen ở chóp và hai mép, phần còn lại màu hồng thịt, giò xám nâu, có 2 cựa (mỗi giò 1 cựa), cá biệt có tới 4 cựa (mỗi giò 2 cựa) màu xám đen. Con cái cựa ít phát triển. Chưa rõ, số liệu mới nghiên cứu thấy mùa sinh sản của gà tiền mặt vàng kéo dài từ tháng 2 - 7. Mỗi lứa đẻ 2 - 3 trứng, vỏ trứng màu trắng ngà. Thời gian ấp 20 - 21 ngày. Trong nuôi nhốt cũng có số lượng trứng đẻ và thời gian ấp tương tự. Thức ăn của Gà tiền mặt vàng là các loại quả, hạt cây trong rừng, ngoài ra chúng ăn thêm côn trùng, giun đất, ốc sên nhỏ ở núi đá vôi. Gà tiền mặt vàng sống đôi hay đàn nhỏ 3 con ở các khu rừng thường xanh ẩm rậm rạp thứ, nguyên sinh, rừng hỗn giao (cây gỗ mọc xen tre, nứa, giang ...) ở độ cao 50-1500m dọc các khe suối, sông, các thung lũng và sườn núi đá vôi. Gà tiền mặt vàng cũng có tập tính ban ngày kiếm ăn ở mặt đất ban đêm bay lên cành cây đậu ngủ. Đồng thời trong cùng sinh cảnh cũng có thể gặp được các loài Trĩ khác như: Gà lôi trắng, Gà lôi hông tía, Gà rừng, các loài Gà so,...', NULL, 'Phân loài 1 - Polyplectron bicalcarratum bicalcaratum (Linnaeus, 1758) phân bố ở Tây Bắc Việt nam.\nPhân loài 2 - Polyplectron bicalcarratum ghigii Delacour và Jabouille, 1924 phân bố ở vùng Đông Bắc kéo dài đến Quảng Nam, Đà Nẵng (Khu bảo tồn thiên nhiên Bà Nà, Núi Chúa) là phân loài đặc hữu của Việt Nam. Phân loài 1 - Polyplectron bicalcarratum bicalcaratum (Linnaeus, 1758) phân bố ở Đông Bắc Thái Lan, Thượng Lào, Trung Quốc (Vân Nam) và Tây Bắc Việt Nam.', NULL, NULL, 'Gà tiền mặt vàng là loài chim quý, có 1 trong hai phân loài là đặc hữu của Việt Nam, có giá trị khoa học, thẩm mỹ, thương mại.', 'VU', NULL, NULL, 'VnCreature'),
(3647, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Polyplectron', NULL, 'GEN_1603', 'polyplectrongermaini', 'Polyplectron germaini', 'Elliot, 1866', 'Gà tiền mặt đỏ', 'SPA_03674', 'Con đực trưởng thành mào lông ở đầu không rõ, da trần quanh mặt màu đỏ. Bộ lông màu gụ thẫm, các sao màu lục biếc rất rõ. Đầu, họng dưới, cổ đốm trắng xám, họng màu trắng, phần dưới điểm nâu tối với chóp mút hung da bò. Cánh, bao cánh có vành sao rộng ở cuối màu violét. Bụng xám đen, lông bao đuôi và lông đuôi giữa không có điểm đen, mút lông đuôi có vạch nâu không đều và có màu vàng nhạt. Chim đực non 1 năm tuổi có bộ lông giống cá thể trưởng thành nhưng không có điểm đen thẫm, các sao ít sặc sỡ, lông đuôi ngắn. Giò chỉ có một cựa, con cái cựa nhỏ hơn con đực, các sao dạng 3 cánh nhỏ và tối hơn. Chim non màu lông đen xỉn. Các cá thể đều có mỏ nâu sừng, mắt nâu, giò xám chì. Chưa rõ về sinh sản của Gà tiền mặt đỏ. Một số nghiên cứu bước đầu cho thấy mùa sinh sản của gà tiền mặt đỏ vào mùa xuân - hè. Theo Delacour (1977) vỏ trứng mầu trắng ngà, kích thước: 45 x 35mm, thời gian ấp là 22 ngày. Cũng như các loài chim khác trong họ Trĩ, Gà tiền mặt đỏ ăn quả, hạt quả côn trùng và giun đất.', NULL, 'Từ Bình Định (Quy Nhơn) đến Đồng Nai. Đã quan sát thấy ở Khánh Hoà, Gia Lai, Kontum, Đắk Lắk, Lâm Đồng, Ninh Thuận, Bình Thuận, Bình Phước, Đồng Nai.  Cambodia.', NULL, NULL, 'Loài quý hiếm của Việt Nam, có giá trị khoa học, thẩm mỹ.', 'VU', NULL, NULL, 'Vncreatures'),
(3648, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Rheinartia', NULL, 'GEN_1728', 'rheinartiaocellata', 'Rheinartia ocellata', '(Elliot, 1871)', 'Trĩ sao', 'SPA_03675', '76-239cm. Chim trưởng thành có lông mày rậm màu trắng; mào dài; da mặt màu hồng; chân màu nâu. Chim trống: Kích thước lớn, đuôi rộng và dài, mào dài, lông cánh thứ cấp không dài. Bộ lông màu nâu tối, nhiều đốm trắng, nâu sẫm và đen; họng trên trắng nhạt. Chim mái: Màu nâu tối, lông có đốm vằn nâu sẫm và đen; họng trên trắng nhạt. Mào ngắn hơn chim đực, màu tối. Mỏ hồng. Chân nâu phớt hồng. Cả chim đực và chim cái chân không có cựa. Tiếng kêu: Hù ú vọng xa, thỉnh thoảng nhắc lại.', NULL, 'Trung Bộ. Cụ thể từ Nam sông Cả vào đến Lâm Đồng. Độ cao phân bố lên tới 1.700-1.900 mét ở vùng Nam Trung Bộ. Phân loài đặc hữu của Trung Nam Lào và Trung Bộ Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3649, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GALLIFORMES', 'GÀ', 'ORD_036', 'Phasianidae', 'Trĩ', 'FAM_284', 'Synoicus', NULL, 'GEN_1893', 'synoicuschinensis', 'Synoicus chinensis', '(Linnaeus, 1766)', 'Cay Trung quốc', 'SPA_03676', '13-15cm. Chim trống trưởng thành: Nhìn chung bộ lông có màu xám đen. Phía trên nâu thẫm có vệt ngang đen, nhưng thân lông màu trắng hay sáng. Đuôi xám đen. Cánh nâu và hung. Cằm họng đen nhạt, dưới má có dải trắng rộng, và trước cổ có một vòng trắng viền đen. Bụng và dưới đuôi hung nâu đỏ. Chim mái: Phía trên giống chim đực, phía dưới không có màu trắng và đen như mô tả ở con đực mà có đốm màu tối gần như ở phía lưng.  Chỗ ẩm thấp có cỏ hay cây trồng khác.', NULL, ' Cả nước, trừ Bắc và Nam Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3650, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Gruidae', 'Sếu', 'FAM_166', 'Grus', NULL, 'GEN_0796', 'grusantigone', 'Grus antigone', '(Linnaeus, 1758)', 'Sếu cổ trụi/Sếu đầu đỏ', 'SPA_03677', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3651, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Heliornithidae', 'Chân Bơi', 'FAM_175', 'Heliopais', NULL, 'GEN_0840', 'heliopaispersonata', 'Heliopais personata', '(G.R. Gray , 1849)', 'Chân bơi', 'SPA_03678', 'Chim đực: Mỏ vàng. Trán, lông mày, mặt họng và trước cổ màu đen với dải hẹp màu trắng từ sau mắt xuống cổ dưới; gáy và sau cổ màu xám. Phần còn lại phía dọc trên cơ thể màu nâu phớt vàng lục. Phần dưới cơ thể màu trắng, sườn nâu nhạt. Chim cái giống chim đực nhưng giữa họng và trước cổ trắng viền đen. Chim non: giống chim cái nhưng đỉnh đầu không đen, họng đen; dải sau mắt xuống cổ dưới vằn trắng. Chân chim đực và cái màu xanh lục. Mùa sinh sản từ tháng 2 - 6, tổ lớn giống tổ quạ, tổ trên cây gần nguồn nước hoặc trong bụi cây; cách mặt nước khoảng 2,7m. Đẻ 5 - 7 trứng, màu kem nhạt có chấm thưa màu nâu hơi đỏ, kích thước 50,3 x 43,2mm. Sống ở các sông, suối trong rừng lá rộng thường xanh, rừng ngập mặn, đầm lầy trong rừng, đôi khi gặp ở các ao, hồ ngoài rừng. Phân bố trong khoảng độ cao từ 700 - 1200m (so với mực nước biển).', NULL, 'Trước đây gặp ở Thuận Hải (nay là Ninh Thuận và Bình Thuận), hiện nay gặp ở Sông Kôn, Khu bảo tồn thiên nhiên Kon Cha Răng (Gia Lai, Kontum và Bình Định), Vườn quốc gia Yok Đôn (Đắk Lắk).  Đông Ấn Độ, Indonesia (Sumatra), Malaixia, Mianma, Thái Lan, Cambodia.', NULL, NULL, 'Có giá trị khoa học.', 'EN', NULL, NULL, 'vncreatures.net'),
(3652, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Amaurornis', NULL, 'GEN_0072', 'amaurorniscinerea', 'Amaurornis cinerea', '(Vieillot, 1819).', 'Gà nước mày trắng', 'SPA_03679', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3653, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Amaurornis', NULL, 'GEN_0072', 'amaurornisphoenicurus', 'Amaurornis phoenicurus', 'Pennant, 1769            ', 'Cuốc ngực trắng', 'SPA_03680', 'Gà mái ngực trắng trưởng thành có phần trên và sườn chủ yếu màu xám đen, mặt, cổ và ngực màu trắng. Bụng dưới và đuôi có màu quế. Cơ thể được làm phẳng về một bên để có thể đi qua đám lau sậy hoặc bụi rậm dễ dàng hơn. Chúng có ngón chân dài, đuôi ngắn, mỏ và chân màu vàng. Giới tính tương tự nhau nhưng con cái có kích thước nhỏ hơn một chút. Chim chưa trưởng thành là phiên bản buồn tẻ hơn nhiều của chim trưởng thành. Những chú gà con có lông tơ có màu đen, giống như tất cả các đường ray.  Những con chim này thường được nhìn thấy đơn lẻ hoặc theo cặp khi chúng kiếm ăn chậm dọc theo mép nước, chủ yếu trên mặt đất nhưng đôi khi leo lên thảm thực vật thấp. Đuôi dựng lên và giật khi chúng bước đi. Mùa làm tổ chủ yếu từ tháng 6 đến tháng 10 nhưng thay đổi theo từng địa phương. Chúng làm tổ ở nơi khô ráo trên mặt đất trong thảm thực vật đầm lầy, đẻ 6-7 quả trứng. Tán tỉnh liên quan đến việc cúi đầu, thanh toán và nhấm nháp. Trứng nở trong khoảng 19 ngày. Cả hai giới đều ấp trứng và chăm sóc gà con. Gà con thường lặn dưới nước để thoát khỏi sự săn mồi. Người ta cho rằng con trưởng thành xây ổ hoặc tổ ấp nơi gà con và con trưởng thành đậu.', NULL, ' phân bố rộng khắp Nam và Đông Nam Á. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Thainationalparks'),
(3654, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Fulica', NULL, 'GEN_0725', 'fulicaatra', 'Fulica astra', 'Linn.', 'Sâm cầm', 'SPA_03681', 'Là loài chim nước giống như vịt, bộ lông màu đen, mỏ và trán có màu trắng. Khi bay có thể thấy một vệt dài mảnh màu trắng chạy dọc theo mép cánh. Bơi lội ở vùng nước thoáng và lặn giỏi. Sống thành đàn. Chạy trên mặt nước để lấy đà trước khi cất cánh bay. Ngón chân có dạng thùy không bình thường. Chim non có màu nhạt hơn và khác với Kịch là không có lông bao dưới đuôi màu trắng. ', NULL, 'Vùng Đông Bắc, đồng bằng Bắc Bộ, Bắc và Trung Bộ, Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3655, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Gallicrex', NULL, 'GEN_0729', 'gallicrexchloropus', 'Gallicrex chloropus', '(Linnaeus, 1758)', 'Kịch đồng', 'SPA_03682', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3656, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Gallicrex', NULL, 'GEN_0729', 'gallicrexcinerea', 'Gallicrex cinera', '(Gmelin, 1789)', 'Gà đồng', 'SPA_03683', '43cm. Thân có tư thế đứng thẳng. Khi bay, cổ và chân duỗi ra. Chim trống trong mùa sinh sản: Bộ lông có màu đen nhạt với mỏ màu vàng, da gốc mỏ màu đỏ và chân màu đỏ. Chim mái và chim ngoài mùa sinh sản: Có màu nâu bánh bích-quy, vạch và vằn màu sẫm hơn; chân màu vàng hoặc xanh lục; mỏ màu vàng. Khi bay trông toàn bộ thân có màu nâu ngoại trừ lưng có sọc và đường viền trước cánh màu trắng.', NULL, ' Vùng Đông Bắc, Trung và Nam Trung Bộ và Nam Bộ. Độ cao phân bố có thể đến 1.200 mét.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3657, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Gallinula', NULL, 'GEN_0731', 'gallinulachloropus', 'Gallinula chloropus', '(Linnaeus, 1758)', 'Kịch', 'SPA_03684', ' Đặc điểm nhận dạng: Có các vạch trắng ngang hông và lông bao dưới đuôi màu trắng. Bơi giật cục. Lội dọc theo mép nước để kiếm mồi. Chim non có màu nâu sẫm hơn. ', NULL, 'Vùng Đông Bắc, Bắc Trung Bộ, Trung và Nam Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3658, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Gallirallus', NULL, 'GEN_0732', 'gallirallusstriatus', 'Gallirallus striatus', '(Linnaeus, 1766)', 'Gà nước vằn', 'SPA_03685', '27cm. Là giống gà nước cỡ trung bình, sống chui lủi. Đỉnh đầu màu hung và phần trên cơ thể có vằn trắng mảnh. Ngực xám. Chim non có màu xám hơn với ngực màu nâu nhạt và phần trên cơ thể có các sọc mờ. Tiếng kêu: Đặc biệt, như tiếng khóc của trẻ con.', NULL, 'Ba Vì', NULL, NULL, NULL, NULL, NULL, NULL, 'Đỗ Tước và Đặng Thanh Long (2013). Chuyên đề điều tra đa dạng động vật rừng trên địa bàn thành phố Hà Nội. Chi Cục Kiểm lâm Hà Nội'),
(3659, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Lewinia', NULL, 'GEN_1073', 'lewiniastriata', 'Lewinia striata', '(Linnaeus, 1766).', 'Gà nước vằn', 'SPA_03686', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3660, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Porphyrio', NULL, 'GEN_1615', 'porphyrioindicus', 'Porphyrio indicus', '(Sangster, 1998)', 'Xít, Chích', 'SPA_03687', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3661, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Porphyrio', NULL, 'GEN_1615', 'porphyrioporphyrio', 'Porphyrio porphyrio', '(Linnaeus, 1758).', 'Xít', 'SPA_03688', 'Trước mắt và xung quanh mắt trắng phớt xám. Đỉnh đầu và hai bên đầu xám thẫm. Phần sau cổ, hai bên cổ và lưng xanh xám. Cánh xám lẫn xanh lục. Phía trước má xám phớt lục. Phía trước cổ và diều lục xám. Bụng, sườn, đùi đen phớt xanh. Đuôi đen hơi phớt xanh. Dưới đuôi trắng. \nCánh: 250; đuôi: 85; giò: 87; mỏ kể cả mào: 71mm. ', NULL, 'có ở khắp các vùng đồng bằng và trung du nhưng thường tập trung nhiều ở Bắc bộ và Nam bộ. Phân loài xít viridis phân bố ở Nam Thái Lan, Lào, Mã Lai, Cămpuchia và Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'Vncreatures'),
(3662, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Porzana', NULL, 'GEN_1616', 'porzanabicolor', 'Porzana bicolor', 'Walden, 1872', 'Cuốc ngực xám', 'SPA_03689', 'Đầu, cổ và mặt bụng xám tro thẫm, đỉnh đầu và gáy thẫm hơn, hai bên đầu nhạt hơn và chuyển dần thành trắng nhạt ở cằm. Mặt lưng, bao cánh và các lông cánh tam cấp hung nâu. Đuôi đen. Lông cánh nâu thẫm. Mắt nâu (chim non), hay đỏ máu (chim trưởng thành). Mỏ lục, chóp mỏ hơi nhạt và phớt xám, gốc mỏ có điểm đỏ. Chân đỏ.', NULL, 'Việt Nam: loài này có ở Lai châu và Lào Cai (Sapa) ở các sông, suối, ao, hồ ở gần rừng.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5311'),
(3663, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Porzana', NULL, 'GEN_1616', 'porzanacinerea', 'Porzana cinerea', '(Vieillot, 1819)', 'Gà nước mày trắng ', 'SPA_03690', '20cm. Chim trưởng thành: Đầu ngực màu xám, mày và vạch dưới mắt màu trắng; trên vai cánh không có vằn; phía lưng có màu nâu với nhiều vệt hơi đen, giữa cổ họng và bụng trắng, sườn và lông bao dưới đuôi hung nâu. Giò màu xanh nhạt.', NULL, 'Vùng Nam Bộ. Gặp ở Vườn Quốc gia Tràm Chim, tỉnh Đồng Tháp.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/bird/white-browed-crake-529'),
(3664, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Porzana', NULL, 'GEN_1616', 'porzanafusca', 'Porzana fusca', '(Linnaeus, 1766)', 'Cuốc ngực nâu', 'SPA_03691', '22cm. Nhỏ hơn các loài cuốc tương tự. Phía lưng có màu nâu, không có hoặc có rất ít lông trắng ở cánh (chỗ khớp cánh). Phần dưới cơ thể màu nâu hơi đỏ, có vằn không rõ nét ở bụng và các vằn đen trắng đặc trưng ở dưới đuôi, có thể nhìn thấy khi đuôi vểnh lên. Chim non có màu nâu hơn. Hoạt động vào lúc hoàng hôn. Vùng đầm lầy nước ngọt, ruộng lúa, đi qua vùng rừng ngập mặn. Có thể gặp đến độ cao gần 1.500 mét. Sinh sản từ tháng 2-6. Đẻ 3-9 trứng. Làm tổ trên mặt đất trong vùng cỏ cây. Định cư và di cư. Định cư khá phổ biến trừ Đông Bắc, Bắc và Nam Trung Bộ. Đồng thời vào mùa đông cũng gặp khá phổ biến ở các vùng phân bố.', NULL, 'Từ Đông Bắc đến Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3665, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Porzana', NULL, 'GEN_1616', 'porzanapaykullii', 'Porzana paykullii', '(Ljungh, 1813).', 'Cuốc nâu', 'SPA_03692', 'Chim trưởng thành:Trên đầu, lông, lông cánh, lông bao cánh, hông và lông nâu vàng lục ở lông bao cánh có bông và sọc ngang trắng, thu hẹp. Mép bên ngoài của lông cánh sơ cấp thứ nhất trắng. Trán và trước mắt, hai bên đầu và cổ, trước cổ và nâu hung Cằm, hồi và giữa bụng trắng nhạt. Phần còn lại của bụng, dưới đuôi, sườn và dưới cánh nâu với những dải trắng ngang.\nChim cái: Gần giống chim đực, chỉ khác là lông lục vàng và nhìn chung mặt lưng và mặt bụng sáng hơn.\nChim non: Gần giống chim cái chỉ khác là màu trắng măt Bụng thay đổi: trước cổ và vũng trắng, nhưng phần trên lót có một chiều rộng ngang màu nâu hung. Mỏ nâu, chớp mỏ dưới hơi nhạt. Chân nâu đỏ nhạt.\nKích thước: Cánh (đực): 122 - 130, (cái): 116, 7 - 122 mm. ', NULL, 'về mùa đông cuốc Nâu có ở Bắc bộ (Sơn Tây) và đồng bằng Nam bộ. vùng đông Bắc châu Á, mùa đông cư xuống phía Nam đến Mã Lai và lnđônêxia.', NULL, NULL, NULL, NULL, NULL, NULL, 'Vncreatures'),
(3666, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Porzana', NULL, 'GEN_1616', 'porzanapusilla', 'Porzana pusilla', '(Pallas, 1776).', 'Cuốc nâu', 'SPA_03693', 'Chim cuốc lùn có chiều dài thân 16–18 cm, mỏ chim ngắn, thẳng, màu vàng hoặc màu xanh. Chim trưởng thành có lưng chủ yếu là màu nâu với vài đốm trắng, bụng và mặt màu xanh xám. Chúng có đôi chân màu xanh lá cây với các ngón chân dài, đuôi ngắn.', NULL, 'Môi trường sinh sản của cuốc lùn chủ yếu ở Đông Âu và châu Á. Chúng làm tổ trong những khóm lau sậy ẩm, mỗi tổ trứng có từ 4 đến 8 quả. Cuốc lùn là loài chim di cư, mùa đông chúng chuyển đến Đông Phi và Nam Á.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Cu%E1%BB%91c_l%C3%B9n'),
(3667, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Rallina', NULL, 'GEN_1708', 'rallinaeurizonoides', 'Rallina eurizonoides', '(Lafresnaye, 1845)', 'Gà nước họng trắng', 'SPA_03694', '25cm. Không giống như hầu hết các loài gà nước khác. Phần trên cơ thể có màu nâu đất chuyển dần sang màu hung nâu ở đầu, cổ và ngực. Phía bụng có vằn đen trắng dày. Khi không bay thì ở cánh không nhìn thấy có hoặc chỉ nhìn thấy ít màu trắng. Giò và mỏ màu xám. Màu hung nâu tối ở chim non được thay bằng màu nâu ôliu. Thỉnh thoảng bay vào các bụi cây. Các chỗ có nước hoặc gần nguồn nước trong các vùng rừng và các vùng cây bụi thứ sinh. Sinh sản từ tháng 7-9, tổ làm trên mặt đất giữa các đám cỏ dại, đẻ 4-8 trứng. Mùa sinh sản có thể gặp bay qua ở vùng Đông Bắc, đồng thời còn gặp tại đây vào mùa đông. Không rõ tính chất cư trú tại vùng Trung Trung Bộ. Không phổ biến.', NULL, 'Đông Bắc Đông Nam Bộ. Phân bố tới độ cao khoảng 1.800 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3668, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Rallina', NULL, 'GEN_1708', 'rallinafasciata', 'Rallina fasciata', '(Raffles, 1822)', 'Gà nước họng nâu', 'SPA_03695', 'Chim trưởng thành: Toàn bộ đầu, cổ và ngực nâu thẫm, cằm và trước cổ thường hơi nhạt hơn và đỉnh đầu thẫm hơn. Phần mặt lưng còn lại, vai và các lông cánh sơ cấp trong cùng nâu hung. Lông bao cánh đen với nhưng dải trắng rộng. Đuôi nâu thẫm có vằn trắng nhạt. Mặt bụng vằn đen trắng, dưới đuôi ít nhiều phớt hung.\nChim non: Đầu và cổ cùng màu với lưng, ngực nâu nhạt hơn, phần mặt lưng còn lại trắng nhạt lẫn với vằn ngang nâu. Mắt đỏ thẫm. Da trần ở mắt đỏ. Mỏ đen nhạt, gốc mỏ nhạt hơn có phớt lục nhạt. Chân đỏ tươi.\nKích thước: Cánh: 118 - 131; đuôi: 49 - 51; mỏ: 20 - 21 mm. ', NULL, 'chỉ mới bắt được Loài này ở Nam bộ.  Nam Miến Điện, Mã Lai và Inđônêxia.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(3669, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Rallus', NULL, 'GEN_1709', 'rallusaquaticus', 'Rallus aquaticus', 'Linnaeus, 1758', 'Gà nước', 'SPA_03696', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3670, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Rallus', NULL, 'GEN_1709', 'rallusstriatus', 'Rallus striatus', '(Linnaeus, 1766)            ', 'Gà nước vằn', 'SPA_03697', 'Chim trưởng thành:Đỉnh đầu hung. Mặt lưng nâu thẫm có nhiều vằn lượn sóng trắng, phần dưới lưng và lông cánh sơ cấp có nhiều chấm trắng, mỗi lông đều viền nâu hơi vàng. Cằm và họng trắng. Hai bên đầu, trước cổ và ngực xám tro. Bụng, sườn, dưới cánh, nách và dưới đuôi nâu thẫm có vạch trắng. Chim cái màụ hơí xỉn hơn và bụng màu nhạt hơn. Mắt nâu nhạt (chim non) hay đỏ (chim trưởng thành). Mỏ trên và chóp mỏ dưới nâu, gốc mỏ dưới đỏ. Chân xám vàng.\nKích thước:Cánh: l08 - 135; đuôi: 38 - 41; giò: 34 - 37; mỏ: 31 - 34mm. ', NULL, 'Loài này có ở hầu hết các vùng từ đồng bằng đến miền núi cao. Ấn Độ. Xây lan, Miến Điện, Thái Lan, Nam Trung Quốc, Đông Dương, Mã Lai và Inđônêxia', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(3671, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Zapornia', NULL, 'GEN_2068', 'zaporniafusca', 'Zapornia fusca', '(Desmarest, 1817)', 'Cuốc ngực nâu', 'SPA_03698', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3672, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Rallidae', 'Gà Nước', 'FAM_315', 'Zapornia', NULL, 'GEN_2068', 'zaporniapusilla', 'Zapornia pusilla', '(Pallas, 1776)', 'Cuốc lùn', 'SPA_03699', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3673, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Turnicidae', 'Cun Cút', 'FAM_384', 'Turnix', NULL, 'GEN_2003', 'turnixsuscitator', 'Turnix suscitator', '(Gmelin, JF, 1789)', 'Cun cút lưng nâu', 'SPA_03700', '17cm. Chim mái cổ màu đen và chim đực có vằn đen đậm là các đặc điểm dễ nhận dạng. Khi bay nhìn thấy túm lông màu tối (màu đen ở con cái) với nhiều mảng lông có màu hung tương phản. Vùng cỏ khô, cây bụi thứ sinh và nơi canh tác. Làm tổ trong cỏ, đẻ 3-5 trứng.', NULL, ' Các vùng trong cả nước. Có thể lên tới độ cao khoảng 1.600 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3674, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Turnicidae', 'Cun Cút', 'FAM_384', 'Turnix', NULL, 'GEN_2003', 'turnixsylvaticus', 'Turnix sylvaticus', 'Desfontaines, 1789            ', 'Cun cút nhỏ', 'SPA_03702', 'Chim đực trưởng thành: Một dải hung nâu nhạt chạy dọc từ trán đến sau gáy. Hai bên đỉnh đầu hung nâu đến nâu, với những vệt đen nhỏ, trong lúc đó dải nhạt ở giữa lại không có vệt nào. Trước mắt, trên mắt và hai bên đầu trắng hay trắng nhạt có tia đen. Phía sau cổ màu nâu gỉ sắt đến nâu đỏ. Lưng, hông và trên đuôi có vằn đen và nâu không đều. Màu lông này thay đổi ít nhiều tùy con. Nhìn chung ở hông và trên đuôi nhiều màu đen hơn ở lưng. Vai, các lông bao cánh trong và các lông cánh thứ cấp trong cùng giống màu lưng, nhưng mỗi lông đều có viền nâu rộng. Các lông bao cánh khác nâu hung với một vệt đen ở phiến lông ngoài và mép lông hung nâu, ở một vài con mép này rất rộng. Lông bao cánh sơ cấp xám nâu với mẻp nâu. Lông cánh sơ cấp nâu hay xám nâu với mép hung nâu. Cằm và họng trắng, ngực hung nâu, sườn trắng hay hung trắng. Bụng trắng hay trắng phớt hung dưới đuôi màu hơi thẫm hơn. Mắt vàng nhạt. Mỏ xám nhạt. Chân trắng hồng, xám nhạt hay xám xanh nhạt. Kích thước, Cánh (đực): 61 – 71, (cái): 67 – 75; đuôi: 31 – 37; giò: 18 – 20; mỏ: 10 – 11 mm.', NULL, 'Loài cun cút này phân bố ở Ấn Độ, Bắc Miến Điện, Thái Lan, Nam Trung Quốc (có cả ở Hải Nam). Việt Nam chỉ mới bắt được Loài này ở Quảng Ninh.', NULL, NULL, NULL, NULL, NULL, NULL, 'nongnghiepchuyendoiso.wordpress.com'),
(3675, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'GRUIFORMES', 'SẾU', 'ORD_038', 'Turnicidae', 'Cun Cút', 'FAM_384', 'Turnix', NULL, 'GEN_2003', 'turnixtanki', 'Turnix tanki', 'Blyth, 1843', 'Cun cút lưng hung', 'SPA_03703', '17cm. Chân màu vàng có thể nhìn thấy được khi chim đang bay. Lông ở phần trên cánh có màu sắc rất tương phản. Vùng cây bụi rậm thứ sinh, xung quanh các nương rẫy, nơi canh tác. Sinh sản trong khoảng tháng 5-8, tổ làm trên mặt đất.', NULL, 'Các vùng trong cả nước. Có thể lên tới khoảng 2.000 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3676, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Acanthizidae', 'Lâm Oanh', 'FAM_001', 'Gerygone', NULL, 'GEN_0758', 'gerygonesulphurea', 'Gerygone sulphurea', 'Wallace, 1864', 'Chích bụng vàng ', 'SPA_03704', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3677, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Acrocephalidae', 'Chim Chích', 'FAM_004', 'Acrocephalus', NULL, 'GEN_0028', 'acrocephalusaedon', 'Acrocephalus aedon', '(Pallas, 1776)', 'Chích mỏ rộng', 'SPA_03705', 'Đây là loài chim chích lớn, dài 16–17,5 cm (6,3–6,9 in), gần bằng loài chim chích sậy lớn . Con trưởng thành có lưng màu nâu không có sọc và phần dưới màu trắng, với một số đặc điểm bộ lông đặc biệt rõ ràng . Trán tròn, mỏ ngắn và nhọn. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3678, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Acrocephalidae', 'Chim Chích', 'FAM_004', 'Acrocephalus', NULL, 'GEN_0028', 'acrocephalusbistrigiceps', 'Acrocephalus bistrigicepe', 'Swinhoe, 1860.', 'Chích đầu nhọn mày đen', 'SPA_03706', '14cm. Lông mày dài nằm dưới dải màu đen chạy dọc hai bên đỉnh đầu. Phần trên cơ thể màu nâu ô liu, ở hông nhìn sáng hơn. Mỏ ngắn nhỏ. Tiếng kêu: Thánh thót hơn Chích đầu nhọn phương đông. Có thể nghe tiếng hót khi di chuyển vào mùa xuân.', NULL, 'Vùng Đông Bắc, Trung Trung Bộ và Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3679, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Acrocephalidae', 'Chim Chích', 'FAM_004', 'Acrocephalus', NULL, 'GEN_0028', 'acrocephalusbrunnescens', 'Acrocephalus brunnescens', '(Jerdon, 1839)', 'Chích đầu nhọn', 'SPA_03707', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3680, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Acrocephalidae', 'Chim Chích', 'FAM_004', 'Acrocephalus', NULL, 'GEN_0028', 'acrocephalusconcinens', 'Acrocephalus concinens', '(Swinhoe, 1870)', 'Chích cánh cụt', 'SPA_03708', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3681, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Acrocephalidae', 'Chim Chích', 'FAM_004', 'Acrocephalus', NULL, 'GEN_0028', 'acrocephalusorientalis', 'Acrocephalus orientalis', '(Temminck & Schlegel, 1847)', 'Chích đầu nhọn phương Đông', 'SPA_03709', '20cm. Loài chích có kích thước lớn, lông mày trắng; mỏ thẳng và dài; sườn màu hung nhạt, hông màu hạt dẻ. Họng có vệt màu xám nhạt. Những con mới thay lông, mút lông đuôi trắng nhợt. Gáy màu da cam. Chim non vào mùa thu màu nâu đỏ; những con đã trưởng thành (lông sờn) màu bạc hơn. Lông trên gáy thỉnh thoảng dựng đứng. Tiếng kêu: ‘chark’ to, có tiếng hót cao lanh lảnh vào mùa xuân.', NULL, 'Tìm thấy khá phổ biến ở đồng bằng sông Cửu Long trong năm 1999.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/group/oriental-reed-warbler-800'),
(3682, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Acrocephalidae', 'Chim Chích', 'FAM_004', 'Acrocephalus', NULL, 'GEN_0028', 'acrocephalusstentorius', 'Acrocephalus stentorius', '(Ehrenberg, 1833) ', 'Chích đầu nhọn', 'SPA_03710', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3683, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Acrocephalidae', 'Chim Chích', 'FAM_004', 'Arundinax', NULL, 'GEN_0167', 'arundinaxaedon', 'Arundinax aedon', '(Pallas, 1776)', 'Chích mỏ rộng', 'SPA_03711', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3684, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Aegithalidae', 'Bạc Má Đuôi Dài', 'FAM_006', 'Aegithalos', NULL, 'GEN_0036', 'aegithalosconcinnus', 'Aegithalos concinnus', '(Gould, 1855). ', 'Bạc má đuôi dài', 'SPA_03712', '10cm. Kích thước nhỏ, đầu hung đỏ và họng có vệt đen. Chim non có mào lông màu gụ nhạt. Tiếng kêu: Phát ra âm ‘t-uyt’ rất đanh.', NULL, 'Tây Bắc, Trung và Nam Trung Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3685, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Aegithinidae', 'Chim Xanh', 'FAM_007', 'Aegithina', NULL, 'GEN_0037', 'aegithinalafresnayei', 'Aegithina lafresnayei', '(Hartlaub, 1844)', 'Chim nghệ lớn', 'SPA_03714', 'là chim dạng sẻ kích thước từ nhỏ tới trung bình, dài khoảng 11,5 đến 15,5 cm (4,5–6,1 in). Tổng thể thì chim trống to lớn hơn chim mái. Chúng trông tương tự như chào mào, nhưng trong khi nhóm chim chào mào có xu hướng có bộ lông nâu xám xỉn thì chim nghệ lại có bộ lông tươi màu hơn', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(3686, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Aegithinidae', 'Chim Xanh', 'FAM_007', 'Aegithina', NULL, 'GEN_0037', 'aegithinaspp', 'Aegithina spp', '            ', 'Chim nghệ nhỏ ', 'SPA_03715', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3687, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Aegithinidae', 'Chim Xanh', 'FAM_007', 'Aegithina', NULL, 'GEN_0037', 'aegithinatiphia', 'Aegithina tiphia', '(Linnaeus)', 'Chim nghệ ngực vàng', 'SPA_03716', 'Chim đực trưởng thành:\nBộ lông mùa hè. Trước mắt, trán, đỉnh đầu, lưng, trên đuôi và đuôi đen. Hông lục. Cánh đen với hai dải trắng rộng do các mút trắng của các lông bao cánh nhỡ và bao cánh lớn tạo thành, mép của các lông cánh thứ cấp trong cùng trắng, các lông cánh thứ cấp ngoài và lông cánh sơ cấp có viền trắng hẹp.\nTai, hai bên đầu và toàn bộ mặt lưng vàng, hơi phớt lục ở hai bên sườn, phần cuối bụng và dưới đôi, họng và trước cổ có màu tươi hơn. Các vật mẫu bắt được Việt Nam không có màu đen ở trán, đỉnh đầu, trước mắt và lưng mà các phần này có màu lục vàng nhạt.\nBộ lông mùa Đông. Giống bộ lông chim cái nhưng đuôi đen hơn, mặt bụng có màu vàng tươi hơn.\nChim cái:\nMặt lưng lục hay lục phớt vàng. Đuôi màu đen nhạt phớt lục vàng. Phần đen ở cánh chim đực thay bằng nâu thẫm, mép các lông phớt vàng. Mặt bụng vàng, phớt lục xám nhạt ở sườn.\nMắt trắng vàng nhạt, đôi khi nâu. Mỏ xám xanh, sống mỏ đen nhạt. Chân đen xám hay xanh xám.\nKích thước:\nCánh: 59 - 68; đuôi: 5 - 53; giò: 18 - 19; mỏ: 12 - 13mm', NULL, 'Ba Vì', NULL, NULL, NULL, NULL, NULL, NULL, 'Đỗ Tước và Đặng Thanh Long (2013). Chuyên đề điều tra đa dạng động vật rừng trên địa bàn thành phố Hà Nội. Chi Cục Kiểm lâm Hà Nội'),
(3688, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Alaudidae', 'Sơn Ca', 'FAM_010', 'Alauda', NULL, 'GEN_0056', 'alaudagulgula', 'Alauda gulgula', 'Franklin, 1831', 'Sơn ca', 'SPA_03717', '16cm. Có lông mào ngắn sau đầu, dựng lên khi gặp phải tác động nào đó từ bên ngoài. Lông mày hơi vàng dễ thấy. Dạn người, có thể tiếp cận cách vài mét, bay lên theo đường thẳng đứng rồi là xuống mặt đất. Lông đuôi có viền màu trắng nhạt. Thường sống thành đàn ngoài thời kì sinh sản. Tiếng kêu: Có tiếng hót thánh thót, liên tục lúc đậu trên mặt đất cũng như khi bay lên cao. Tiếng gọi bạn thường là tiếng ‘drzz’ khô khốc và ồn ào.', NULL, 'Ba Vì', NULL, NULL, NULL, NULL, NULL, NULL, 'Đỗ Tước và Đặng Thanh Long (2013). Chuyên đề điều tra đa dạng động vật rừng trên địa bàn thành phố Hà Nội. Chi Cục Kiểm lâm Hà Nội'),
(3689, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Alaudidae', 'Sơn Ca', 'FAM_010', 'Mirafra', NULL, 'GEN_1236', 'mirafraassamica', 'Mirafra assamica', 'Horsfield, 1840', 'Sơn ca Thái Lan', 'SPA_03718', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3690, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Alaudidae', 'Sơn Ca', 'FAM_010', 'Mirafra', NULL, 'GEN_1236', 'mirafraerythrocephala', 'Mirafra erythrocephala', 'Salvadori & Giglioli, 1885', 'Sơn ca đông dương', 'SPA_03719', 'Sơn ca Đông dương là loài có kích thước trung bình trong nhóm Sơn ca (khoảng 14 cm). Chim có mỏ lớn màu xám, lông mày trắng nổi bật, nhiều sọc lớn trên thân trên và sọc nhỏ trên ngực. Chim trống và chim mái giống nhau. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnamwildlife'),
(3691, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Alaudidae', 'Sơn Ca', 'FAM_010', 'Mirafra', NULL, 'GEN_1236', 'mirafrajavanica', 'Mirafra javanica', 'Horsfield , 1821', 'Sơn ca java', 'SPA_03720', '15cm. Màu lông nâu nhạt. Có kiểu bay lượn tại chỗ và vỗ cánh điển hình. Khi bay để lộ gốc cánh rộng, mép cánh màu nâu đỏ kể cả lông sơ cấp. Đuôi rất ngắn với lông đuôi ngoài màu trắng dễ nhận. Đặc điểm nổi bật là thường bay thêm một quãng trước khi đậu xuống đất và tìm chỗ ẩn nấp. Mắt tinh, luôn theo dõi phía dưới, mỏ to và có màu vàng nhạt. Mào lông hơi rậm.  Đồng cỏ, ruộng lúa và những nơi trống trải.', NULL, 'Nam Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Birdwatchingvietnam'),
(3692, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Artamidae', 'Nhạn Rừng', 'FAM_033', 'Artamus', NULL, 'GEN_0165', 'artamusfuscus', 'Artamus fuscus', 'Vieillot, 1818            ', 'Nhạn rừng', 'SPA_03721', '18cm. Khác với các loài chim én bởi hai cánh rộng hình tam giác, đuôi ngắn và vuông. Bắt côn trùng trong khi bay. sống: Khu vực cây bụi, chỗ trống trải, thường gặp trên các cành cây khô, chỗ gần vực nước và dọc các đường dây điện. Sống thành đàn. Sống định cư. Gặp tương đối phổ biến lên đến độ cao khoảng 2.100 mét, tuy nhiên phân bố chủ yếu ở đai thấp.', NULL, 'Khắp các vùng. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3693, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Coracina', NULL, 'GEN_0465', 'coracinajavensis', 'Coracina javensis', '(Horsfield, 1821)', 'Phường Chèo lớn', 'SPA_03722', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3694, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Coracina', NULL, 'GEN_0465', 'coracinamacei', 'Coracina macei', '(Lesson, 1830)            ', 'Phường chèo xám lớn', 'SPA_03723', 'Chim trưởng thành: Trước mắt, má và tai đen. Mặt lưng xám tro thẫm, hông và trên đuôi có màu hơi nhạt hơn. Lông cánh đen nhạt, mép viền xám nhạt. Lông đuôi giữa nâu đen, có viền trắng hẹp ở mút lông, các lông đuôi hai bên đen, có mút lông trắng. Cằm, họng và ngực xám, chuyển dần thành xám nhạt ở bụng và dưới đuôi. Chim cái và chim non. Dải mắt và dải má thẫm, mặt bụng có vằn. Mắt nâu hay nâu đỏ. Mỏ và cánh đen. Kích thước: Cánh: 170 - 190; đuôi: 92 - 128; giò: 25 - 29; mỏ: 25 - 30mm ', NULL, 'Việt Nam tìm thấy phân loài này ở Bắc Thái, Vĩnh Phú, Lào Cai, Thanh Hoá và Vườn quốc gia Bù Gia Mập - Bình Phước - theo Hoàng Mình Đức. Phân loài phương chèo xám này phân bố ở Nam Trung Quốc và Bắc Đông Dương', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3695, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Coracina', NULL, 'GEN_0465', 'coracinamelaschistos', 'Coracina melaschista', '(Hodgson, 1836)', 'Phường chèo xám', 'SPA_03724', 'Khi đậu dễ nhận thấy có màu xám và đen, cùng với nhiều mảng trắng ở phiến dưới lông đuôi. Chim mái màu xám hơn, mặt bụng có nhiều vằn, vành mắt màu trắng gãy khúc, khi bay thường để màu xanh nhạt ở hông và một đốm trắng ở mặt dưới cánh. Các vùng rừng núi, kiếm ăn xung quanh các tán cây. Thường thấy ở các bụi cây cao và treo mình trên các vòm cây khi tìm mồi.', NULL, 'Khắp các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3696, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Coracina', NULL, 'GEN_0465', 'coracinanovaehollandiae', 'Coracina novaechollandiae', '(Gmelin, 1789)', 'Phường chèo xám lớn', 'SPA_03725', 'Chim trưởng thành có lông ở phần mặt và họng màu đen, phần lưng màu xám còn phần bụng màu trắng, với mỏ hơi cong. Chúng dài 32 đến 34 xentimét (12,6 đến 13,4 in). Chúng là chim di chuyển chậm và kín đáo, với tiêng kêu nhức óc.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3697, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Coracina', NULL, 'GEN_0465', 'coracinapolioptera', 'Coracina polioptera', 'Sharpe, 1878', 'Phường chèo xám nhỏ', 'SPA_03726', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3698, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Hemipus', NULL, 'GEN_0857', 'hemipuspicatus', 'Hemipus picatus', '(Sykes, 1832)            ', 'Phường chèo đen', 'SPA_03727', 'Có cánh màu đen với đôi cánh màu đen tương phản với màu trắng của cơ thể. Tương phản với một vệt trắng ngang cánh và phần mông trắng nổi bật.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3699, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Lalage', NULL, 'GEN_1015', 'lalagemelaschistos', 'Lalage melaschistos', '(Hodgson, 1836)', 'Phường chèo xám', 'SPA_03728', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3700, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Lalage', NULL, 'GEN_1015', 'lalagepolioptera', 'Lalage polioptera', '(Sharpe, 1879)', 'Phường chèo xám nhỏ', 'SPA_03729', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3701, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Pericrocotus', NULL, 'GEN_1504', 'pericrocotusbrevirostris', 'Pericrocotus brevirostris', '(Vigors, 1831)', 'Phường chèo đỏ mỏ ngắn', 'SPA_03731', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3702, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Pericrocotus', NULL, 'GEN_1504', 'pericrocotuscantonensis', 'Pericrocotus cantonensis', 'R. Swinhoe, 1861', 'Phường chèo cánh trắng', 'SPA_03732', '18cm. Giống như Phường chèo trắng lớn nhưng được phân biệt bởi hông màu xanh nhợt, chim đực và cái đều có đỉnh đầu phía sau màu xám. Chim mái có màu nâu và màu. Cánh có thể không có đốm. Rừng và cửa rừng, lên đến độ cao 1.200 mét. Gặp vào mùa đông, không phổ biến.', NULL, 'Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3703, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Pericrocotus', NULL, 'GEN_1504', 'pericrocotuscinnamomeus', 'Pericrocotus cinnamomeus', 'Linnaeus.1766', 'Phường chèo nhỏ', 'SPA_03733', 'nhỏ dài 16 cm với chiếc mỏ sẫm màu khỏe mạnh và đôi cánh dài. Con đực khác với hầu hết các loài thú nhỏ thông thường khác ở chỗ có phần trên và đầu màu xám, không đen bóng, phần thân dưới màu cam, nhạt dần sang màu vàng ở bụng, mép đuôi màu cam, các mảng mông và cánh.\nCon cái có màu xám ở trên, với phần dưới màu vàng (bao gồm cả mặt), mép đuôi, phần mông và các mảng cánh. Loài chim nhỏ là loài chim sinh sản phổ biến và phổ biến ở các khu rừng gai và bụi rậm. Tổ có cấu trúc giống như cái cốc, trong đó con cái đẻ từ hai đến bốn quả trứng đốm.  Những con nhỏ sẽ tạo thành đàn nhỏ. Thức ăn là côn trùng ', NULL, ' Vùng nhiệt đới phía nam châu Á từ tiểu lục địa Ấn Độ về phía đông đến Indonesia.', NULL, NULL, NULL, NULL, NULL, NULL, 'thainationalparks'),
(3704, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Pericrocotus', NULL, 'GEN_1504', 'pericrocotusdivaricatus', 'Pericrocotus divaricatus', '(Raffles, 1822)            ', 'Phường chèo trắng lớn', 'SPA_03734', 'Con đực có phần sau gáy màu đen, vành tai kéo dài đến tận gáy. Phần còn lại của đầu và nửa cổ hẹp màu trắng, phần dưới màu trắng và phần trên thường có màu xám nhạt, các mép của phần còn lại và phần phủ lớn hơn có màu xám đậm hơn. Con cái có bộ lông cơ thể giống con đực ngoại trừ màu nhạt hơn một chút. Bộ lông trên đầu của con cái khác với con trống thay thế toàn bộ màu đen bằng màu xám, ngoại trừ trên trán và truyền thuyết. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'singaporebirds'),
(3705, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Pericrocotus', NULL, 'GEN_1504', 'pericrocotusethologus', 'Pericrocotus ethologus', 'Bangs&Phillips, 1914            ', 'Phường chèo má xám', 'SPA_03735', 'Chim đực trưởng thành: Tương tự như loài P. flammeus nhưng các lông cánh thứ cấp trong cùng không có vệt đỏ hình bầu dục mà có mép lông đỏ.\nChim cái trưởng thành. Sườn và mặt bụng màu lục vàng, họng trắng phớt vàng.\nKích thước: Cánh: 80 - 101; giò: 16; mỏ: 11 - 12mm ', NULL, 'Phân loài này phân bố ở Trung Quốc. Mùa Đông di cư xuống phía Nam Việt Nam vào mùa Đông gặp phân loài này ở vùng rừng núi thuộc các tỉnh Bắc bộ và tìm thấy ở Lâm Đồng và cao nguyên Di Linh  ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vncreatures'),
(3706, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Pericrocotus', NULL, 'GEN_1504', 'pericrocotusflammeus', 'Pericrocotus flammeus', '(Forster, 1781)            ', 'Phường chèo đỏ', 'SPA_03736', 'Chim đực trưởng thành: Tương tự như loài P. flammeus nhưng các lông cánh thứ cấp trong cùng không có vệt đỏ hình bầu dục mà có mép lông đỏ. Chim cái trưởng thành. Sườn và mặt bụng màu lục vàng, họng trắng phớt vàng. Kích thước: Cánh: 80 - 101; giò: 16; mỏ: 11 - 12mm ', NULL, 'Phân loài này phân bố ở Trung Quốc. Mùa Đông di cư xuống phía Nam Việt Nam vào mùa Đông gặp phân loài này ở vùng rừng núi thuộc các tỉnh Bắc bộ và tìm thấy ở Lâm Đồng và cao nguyên Di Linh ', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3707, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Pericrocotus', NULL, 'GEN_1504', 'pericrocotusroseus', 'Pericrocotus roseus', '(Vieillot, 1818)            ', 'Phường chèo hồng', 'SPA_03737', 'Chiều dài: 18–20 cm; trọng lượng: 14–19 g. Chim trống có màu hồng đậm/đỏ nhạt ở cánh và đuôi còn chim mái có phần mông màu ô liu/màu vàng ô liu. Con đực có trán màu trắng, sọc và mí mắt trên miệng, mi mắt màu đen, mặt đến che tai màu xám nhạt, vương miện đến lưng trên và vảy có màu xám. các khu rừng rụng lá hoặc thường xanh, vùng đất và vườn có nhiều cây cối rậm rạp.', NULL, ' Bangladesh; Bhutan; Trung Quốc; Ấn Độ; Cộng hòa Dân chủ nhân dân Lào; Myanma; Nê-pan; Pakistan; Nước Thái Lan; Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'indiabiodiversity'),
(3708, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Pericrocotus', NULL, 'GEN_1504', 'pericrocotussolaris', 'Pericrocotus solaris', 'Blyth, 1846            ', 'Phường chèo má xám', 'SPA_03738', '18cm. Nhỏ hơn so với Phường chèo đỏ lớn. Chim trống: Được phân biệt bởi màu sắc đỏ rực như lửa (chú ý Phường chèo đỏ lớn, chim đực non có màu vàng da cam), họng và hai bên đầu màu xám. Chim mái: Được phân biệt bởi trán thiếu màu vàng, cánh có đốm. Chim non: Phần dưới cơ thể màu trắng nhạt, các vằn trên cánh vàng hoặc đỏ. Các vùng rừng thưa, nơi có độ cao khoảng từ 600-1.800 mét. Sống định cư, tương đối phổ biến.', NULL, 'Bắc Bộ và Trung Bộ và Tây Nguyên. Gặp ở Hoàng Liên Sơn, Tam Đảo và Đà Lạt. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3709, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Pericrocotus', NULL, 'GEN_1504', 'pericrocotussp', 'Pericrocotus sp.', NULL, 'Phường chèo ', 'SPA_03739', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3710, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Ptilotus', NULL, 'GEN_1684', 'ptilotusdivaricatus', 'Ptilotus divaricatus', '(Raffles, 1822)', 'Phường chèo trắng lớn', 'SPA_03740', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3711, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Tephrodornis', NULL, 'GEN_1929', 'tephrodornisgularis', 'Tephrodornis gularis', '(Raffles, 1822)            ', 'Phường chèo nâu', 'SPA_03741', '23cm. Mặt lưng nâu xám, phía bụng và bao trên đuôi màu trắng, chân đen. sống: Các vùng rừng. Thường kiếm ăn ở tầng tán.  Sống định cư, gặp tương đối phổ biến ở các độ cao khác nhau.', NULL, ' Khắp các vùng rừng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3712, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Tephrodornis', NULL, 'GEN_1929', 'tephrodornispondicerianus', 'Tephrodornis pondicerianus', '(Gmelin , 1789)', 'Phường chèo nâu mày trắng', 'SPA_03742', 'màu nâu xỉn và giống như các loài chim sáo gỗ khác có đầu to với chiếc mỏ hình móc câu khỏe khoắn. Chúng có lông mày rộng màu kem phía trên mảng má sẫm màu và lông đuôi bên ngoài màu trắng tương phản với chiếc đuôi sẫm màu. Chim non có các vệt và đốm trên đỉnh đầu và các đốm trắng trên màng áo. Mặt dưới cũng có sọc và ức có nhiều dấu vết ở chim non. Loài Sri Lanka có màu sẫm tương tự ở mặt dưới, với phần má sẫm màu được viền bên dưới bởi một sọc dưới ria mép và phần mông màu trắng. Thường được tìm thấy theo cặp, chúng có một bài hát huýt sáo lớn được tạo thành từ nhiều nốt nhạc.  Chúng ăn chủ yếu là côn trùng và đôi khi là quả mọng bằng cách mót chủ yếu dọc theo cành và lá trong cây nhưng đôi khi cũng bay lên không trung hoặc lao xuống mặt đất. Chúng có thói quen điều chỉnh đôi cánh của mình, nâng chúng lên trên đuôi ngay sau khi đậu trên một con cá rô. Chúng làm tổ vào mùa hè trước mùa mưa, xây tổ hình cốc trên một chiếc nĩa trần. Tổ được làm bằng sợi và vỏ cây được giữ bằng mạng nhện và được bao phủ bởi các mảnh vỏ cây và địa y. Chim non được cho ăn côn trùng và quả mọng. Hai lứa có thể được nuôi trong một số năm.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'thainationalparks'),
(3713, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Campephagidae', 'Phường Chèo', 'FAM_060', 'Tephrodornis', NULL, 'GEN_1929', 'tephrodornisvirgatus', 'Tephrodornis virgatus', '(Temminck, 1824)', 'Phường chèo nâu', 'SPA_03743', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3714, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Cettiidae', 'Chích Đớp Ruồi', 'FAM_071', 'Phyllergates', NULL, 'GEN_1543', 'phyllergatescucullatus', 'Phyllergates cucullatus', '(Temminck, 1836)', 'Chích bông đầu vàng', 'SPA_03744', '12cm. Chim trưởng thành: Bộ lông màu xanh lục, lông ở bụng và dưới đuôi có màu vàng; trán hung vàng, lông mày trắng dài; mỏ dài; không có vằn trên vai cánh. Rừng thường xanh, rừng tre nứa, thảm cây bụi.', NULL, 'Bắc Bộ, Bắc và Nam Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3715, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Chloropseidae', 'Chim Xanh', 'FAM_080', 'Chloropsis', NULL, 'GEN_0391', 'chloropsisaurifrons', 'Chloropsis aurifrons', 'Temminck, 1829', 'Chim xanh trán vàng', 'SPA_03745', ' 18-19cm. Đặc điểm nổi bật là trán có màu vàng da cam, chim đực có họng màu đen.  Loài định cư phổ biến, có thể phân bố đến độ cao khoảng 1.200 mét.  Các loại rừng, nhiều hơn ở rừng khộp.', NULL, 'Từ Trung Bộ đến Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3716, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Chloropseidae', 'Chim Xanh', 'FAM_080', 'Chloropsis', NULL, 'GEN_0391', 'chloropsiscochinchinensis', 'Chloropsis cochichinesis', '(Gmelin, 1788)', 'Chim xanh nam bộ', 'SPA_03746', 'Chim xanh Nam bộ có kích thước tương tự như các loài chim xanh khác (khoảng 17 cm). Con trống và con mái khác nhau. Con trống có đỉnh đầu màu vàng, mặt và cổ họng đen trong khi con mái có đầu màu xanh là cây và cổ họng màu xanh da trời. Cả hai đều có thân màu xanh với lông ngoài cùng của cánh màu xanh lá cây. Con non tương tự như con mái nhưng không có màu xanh lá cây ở cổ họng và ngoài cánh. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnamwildlife'),
(3717, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Chloropseidae', 'Chim Xanh', 'FAM_080', 'Chloropsis', NULL, 'GEN_0391', 'chloropsishardwickii', 'Chloropsis hardwichii', '(Jardine & Selby, 1830)', 'Chim xanh hông vàng', 'SPA_03747', '2cm. Chim trống rất dễ nhận ra bởi phía dưới cơ thể màu da cam vàng cháy. Chim mái màu xanh sáng, vạch dưới tai màu xanh hoa cà và ánh bạc, màu đen ở dưới mắt. Chim non hoàn toàn màu xanh. Tiếng kêu: Nhiều âm lượng như Chèo bẻo, có thể bắt chước tiếng kêu của các loài chim khác sống trong vùng.', NULL, 'Từ Bắc Bộ đến Trung Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3718, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Chloropseidae', 'Chim Xanh', 'FAM_080', 'Chloropsis', NULL, 'GEN_0391', 'chloropsislazulina', 'Chloropsis lazulina', '(Swinhoe, 1870).', 'Chim xanh họng tím', 'SPA_03748', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3719, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Chloropseidae', 'Chim Xanh', 'FAM_080', 'Chloropsis', NULL, 'GEN_0391', 'chloropsismoluccensis', 'Chloropsis moluccensis', '(Gmelin, 1788)            ', 'Chim xanh nam bộ', 'SPA_03749', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3720, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Cinclidae', 'Lội Suối', 'FAM_088', 'Cinclus', NULL, 'GEN_0412', 'cincluspallasii', 'Cinclus pallasii', '(Temminck, 1820)            ', 'Luội suối', 'SPA_03750', '22cm. Kích thước tương đối lớn, mình tròn, màu nâu sô-cô-la. Bộ lông chim non có hình vẩy. Bay nhanh là là trên mặt nước, luôn phát tra tiếng huýt sáo chói tai.', NULL, 'Bắc Bộ và Bắc Trung Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3721, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Cisticolidae', 'Chiền Chiện', 'FAM_089', 'Cisticola', NULL, 'GEN_0420', 'cisticolaexilis', 'Cisticola exilis', '(Vigors & Horsfield, 1827).', 'Chiền chiện đồng vàng', 'SPA_03751', '12cm. Mùa đông có đuôi dài hơn Chiền chiện đồng hung, khi bay giống các loài thuộc giống Prinia. Được phân biệt bởi tiếng kêu giọng mũi đơn âm tiết, mút lông đuôi màu hung nâu sẫm. Lông đỉnh đầu luôn dựng thẳng tạo thành mào. Trong thời kì sinh sản có đuôi ngắn hơn và đầu con trống có màu xám bạc.  Định cư phổ biến, gặp lên tới độ cao khoảng 1.200 mét. Bãi cỏ tại các vùng địa hình khác nhau.', NULL, 'Từ phía Nam đèo Hải Vân đến hết Đông Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3722, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Cisticolidae', 'Chiền Chiện', 'FAM_089', 'Cisticola', NULL, 'GEN_0420', 'cisticolajuncidis', 'Cisticola juncidis', '(Rafinesque, 1810)            ', 'Chiền chiện đồng hung', 'SPA_03752', '11cm. Kích thước cơ thể nhỏ, có sọc vằn, đuôi ngắn với dải đen ở gần cuối đuôi, mút các lông đuôi trắng. Mùa đông đuôi dài hơn. Chim trống, đầu ít sọc hơn, mùa xuân mào chuyển thành màu nâu xanh nhạt, phớt đỏ. Sống chui rúc, di chuyển từ bụi cỏ này sang bụi cỏ khác. Tìm thấy ở nơi cỏ mọc thưa, thưòng xuyên gặp ở gần chỗ có nước.', NULL, 'Khắp các vùng trong cả nước.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/group/zitting-cisticola-809'),
(3723, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Cisticolidae', 'Chiền Chiện', 'FAM_089', 'Prinia', NULL, 'GEN_1622', 'priniaatrogularis', 'Prinia atrogularis', '(Moore, F, 1854)', 'Chiền chiện núi họng trắng', 'SPA_03753', '18cm. Loài chiền chiện đuôi rất dài, thân kềnh càng. Vành mắt màu đen và lông mày trắng nhìn thấy rất rõ. Hai bên ngực có sọc đen hẹp. Thường tìm thấy trên các triền đồi nơi có cây bụi và độ cao trên 1000 mét, nhưng mùa đông di chuyển xuống thấp hơn. Tiếng kêu: ‘cho-ip, cho-ip’ to, lặp đi lặp lại.', NULL, 'Bắc Bộ, Nam Trung Bộ và Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3724, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Cisticolidae', 'Chiền Chiện', 'FAM_089', 'Prinia', NULL, 'GEN_1622', 'priniaflaviventris', 'Prinia flaviventris', '(Delessert, 1840)', 'Chiền chiện bụng vàng', 'SPA_03754', '13cm. Chim trưởng thành có đầu màu xám xanh, bụng vàng. Các con khác, đầu có màu nâu sẫm hơn, phía bụng màu vàng, nên dễ phân biệt; lông mày và vành mắt đôi khi không có. Chim non sắp trưởng thành, phía lưng có màu nâu sẫm hơn. Đuôi thường vểnh lên, động tác bay nặng nề và yếu đuối, khi bay phát ra âm thanh   Khu vực cỏ dại và cây bụi. Chỉ hót khi đậu. Phổ biến ở vùng đầm lầy có cỏ mọc cao.  Sống định cư. Gặp tương đối phổ biến trong vùng phân bố lên đến độ cao khoảng 1.200 mét.', NULL, 'Từ Đông Bắc đến Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3725, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Cisticolidae', 'Chiền Chiện', 'FAM_089', 'Prinia', NULL, 'GEN_1622', 'priniahodgsonii', 'Prinia hodgsonii', 'Blyth, 1844            ', 'Chiên chiện lưng xám', 'SPA_03755', '12cm. Mỏ rất mảnh, mút lông đuôi trắng. Giống Chiền chiện đầu nâu trong thời kì sinh sản, nhưng thường không có lông mày màu trắng, ngực xám. Những chỗ có cây cỏ rậm rạp hoặc thưa thớt.  Sống định cư và thường gặp tương đối phổ biến trong các vùng phân bố lên đến độ cao khoảng 1.500 mét.', NULL, 'Từ Đông Bắc đến Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3726, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Cisticolidae', 'Chiền Chiện', 'FAM_089', 'Prinia', NULL, 'GEN_1622', 'priniainornata', 'Prinia inornata', '(Skyes, 1832)            ', 'Chiền chiện bụng hung', 'SPA_03756', ' 15cm. Trừ khi hót, còn lại rất khó phân biệt với chim non của Chiện bụng vàng, mặc dù có đuôi dài hơn. Tất cả đều có lông mày mọc dài. Bộ lông ngoài mùa sinh sản có đuôi dài bằng chiều dài thân. Đuôi vểnh. Dáng bay nặng nhọc và yếu ớt.   sống: Những chỗ gần nước, bãi cỏ, ruộng lúa, cây bụi, vùng chân đồi và xung quanh các bãi chăn thả gia súc.  Sống định cư. Gặp phổ biến lên tới độ cao khoảng 900 mét.', NULL, 'Từ Đông Bắc đến hết Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3727, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Cisticolidae', 'Chiền Chiện', 'FAM_089', 'Prinia', NULL, 'GEN_1622', 'priniapolychroa', 'Prinia polychroa', '(Temminck , 1828)', 'Chiền chiện núi', 'SPA_03757', '18cm. Giống Chiền chiện bụng vàng, song đuôi dài hơn. Phía lưng có sọc nhưng không rõ lắm, khó thấy vào mùa hè khi bộ lông đã sờn. Lông đuôi sớm bị sờn hơn. Bay yếu và giật cục  Khu vực cỏ dại và cây bụi lên đến độ cao trên khoảng 1.200 mét. Bình thường làm tổ ở độ cao trên 1000 mét, nhưng vào mùa đông thì di chuyển xuống đai thấp hơn.  Sống định cư, thỉnh thoảng gặp ở ven các vùng đồi núi.', NULL, ' Nam Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3728, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Cisticolidae', 'Chiền Chiện', 'FAM_089', 'Prinia', NULL, 'GEN_1622', 'priniarufescens', 'Prinia rufescens', '(Blyth, 1842)            ', 'Chiền chiện đầu nâu', 'SPA_03758', '12cm. Giống Chiền chiện bụng hung, nhưng đuôi ngắn hơn và mút lông đuôi trắng nhạt. Hông và đuôi màu nâu hung đỏ. Trong mùa sinh sản, đầu xám xanh. Tìm thấy ở các vùng rừng thứ sinh; thường gặp trong các rừng cây gỗ.', NULL, 'Từ Đông Bắc đến Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3729, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Cisticolidae', 'Chiền Chiện', 'FAM_089', 'Prinia', NULL, 'GEN_1622', 'priniasuhfflava', 'Prinia suhfflava', '(Gmelin, JF, 1789)', 'Chiên chiện bụng hung', 'SPA_03759', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3730, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Cisticolidae', 'Chiền Chiện', 'FAM_089', 'Prinia', NULL, 'GEN_1622', 'priniasuperciliaris', 'Prinia superciliaris', '(Moore , 1854)', 'Chiền chiện núi họng trắng', 'SPA_03760', '18cm. Loài chiền chiện đuôi rất dài, thân kềnh càng. Vành mắt màu đen và lông mày trắng nhìn thấy rất rõ. Hai bên ngực có sọc đen hẹp. Thường tìm thấy trên các triền đồi nơi có cây bụi và độ cao trên 1000 mét, nhưng mùa đông di chuyển xuống thấp hơn.  Bãi cỏ, cây bụi rậm rạp và thấp, và còn gặp cả nơi trống trải trong rừng.  Sống định cư. Thỉnh thoảng gặp ở nhiều nơi trong các vùng phân bố.', NULL, ' Bắc Bộ, Nam Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3731, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Corvidae', 'Quạ', 'FAM_103', 'Cissa', NULL, 'GEN_0419', 'cissachinensis', 'Cissa chinensis', '(Boddaert, 1783)            ', 'Giẻ cùi xanh', 'SPA_03761', 'Nó có màu xanh lá cây sống động màu (thường có màu ngọc lam trong điều kiện nuôi nhốt), màu nhẹ ở mặt dưới và có một sọc đen dày từ mỏ (thông qua mắt) đến gáy. So với các thành viên khác của chi của nó, cái đuôi có đầu màu trắng là khá dài. Điều này tất cả tương phản màu đỏ sinh động của vành mắt, mỏ và chân. Cánh có màu nâu sẫm hơi đỏ. Con chim này tìm kiếm thức ăn cả trên mặt đất và trên cây, và có một tỷ lệ rất cao con mồi gồm động vật không xương sống, bò sát nhỏ, động vật có vú, chim non và trứng. Nó cũng ăn thịt của con vật mới bị giết chết. Tổ được xây trên cây, cây bụi lớn và thường xuyên trong các đám rối của dây leo khác nhau trên núi. Mỗi tổ thường có 4-6 trứng.', NULL, ' được tìm thấy từ dưới Hymalaya ở vùng đông bắc Ấn Độ trong một dải rộng lớn đông nam vào trung bộ Thái Lan, Lào, Campuchia, Việt Nam, Malaysia, Sumatra và tây bắc Borneo ', NULL, NULL, NULL, NULL, NULL, NULL, 'Wikipedia'),
(3732, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Corvidae', 'Quạ', 'FAM_103', 'Cissa', NULL, 'GEN_0419', 'cissahypoleuca', 'Cissa hypoleuca', '(Salvadori & Giglioli, 1885). ', 'Giẻ cùi bụng vàng', 'SPA_03762', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3733, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Corvidae', 'Quạ', 'FAM_103', 'Cissa', NULL, 'GEN_0419', 'cissathalassina', 'Cissa thalassina', '(Temminck, 1826)', 'Giẻ cùi bụng vàng', 'SPA_03763', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3734, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Corvidae', 'Quạ', 'FAM_103', 'Corvus', NULL, 'GEN_0470', 'corvusmacrorhynchos', 'Corvus macrohynchos', 'Wagler, 1827', 'Quạ đen', 'SPA_03764', 'Bộ lông có màu đen. Mỏ to, rất khoẻ Sống định cư ở độ cao từ 1.500 đến 2.200m trong các sinh cảnh khác nhau đồng bằng, thành phố, vùng ven biển và rừng ngập mặn', NULL, 'Hầu hết các tỉnh cả nước Thái Lan, Lào, Cambodia, Trung Quốc', NULL, NULL, 'Có giá trị nghiên cứu khoa học và góp phần điều hoà số lượng cá thể các quần thể con mồi, giúp cân bằng sinh thái tự nhiên', NULL, NULL, NULL, 'VnCreature'),
(3735, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Corvidae', 'Quạ', 'FAM_103', 'Corvus', NULL, 'GEN_0470', 'corvustorquatus', 'Corvus torquatus', 'Lesson, 1830', 'Quạ khoang', 'SPA_03765', 'Chim trưởng thành khác với Quạ đen có vòng trắng ở cổ và ngực. Phía trên cổ vòng trắng này rộng tới lưng trên, nhìn ngang phần vai vòng trắng ôm lấy gốc cánh tạo thành hình chữ V. Toàn bộ phần lông còn lại của bộ lông mầu đen có ánh đỏ tím. Mắt, mỏ và giò đều đen. Mùa sinh sản kéo dài từ tháng 3 - 7. Tổ hình cầu đặt trên các cành hay các ngọn cây cao tới 30m trở lên (thường là các cây gạo, đa...). Có thể gặp một đôi hay nhiều đôi cùng làm tổ trên cùng một cây. Tổ làm khá công phu bằng các que và cành cây khô nhỏ ken lại kỹ thuật. Có que đường kính tới 1,5cm, dài 45cm. Trong tổ được lót bằng lớp mỏng lá cây khô và lông chim, vịt, gà... Mỗi lứa đẻ 3-4 trứng, vỏ màu trắng hơi đục. thời gian ấp là khoảng 20 - 22 ngày.\n\nThức ăn là ngoé, nhái, chuột, giun đất, côn trùng. Thời gian nuôi con sắp rời tổ thiếu thức ăn, Quạ khoang bắt cả gà, vịt con mới nở khi chăn thả ở ngoài đồng ruộng và thấy tha cả bắp ngô non ở bãi nương về ăn. Thay lông vào tháng 8 - 10 hàng năm.\n\nQuạ khoang sống định cư, làm tổ ở cả vùng ven biển, cửa sông, đồng bằng, trung du và miền núi có độ cao đến 1500m (Cao Bằng, Lạng Sơn, Bắc Kạn) gần các nơi trồng trọt, dân cư sinh sống. Chúng thường kiếm ăn ở các khu vực gần đất ngập nước, bãi lầy, bãi triều sau nước rút. Chúng cũng kiếm ăn cùng với Quạ đen, Sáo mỏ ngà, vv. Là kẻ thù của các loài chim nhỏ, gia cầm lúc mới nở ít ngày.', NULL, 'Từ Bắc Bộ đến Trung Trung Bộ. Phía đông Trung Quốc (đảo Hải Nam).', NULL, NULL, 'Quý hiếm, có thể bắt chước tiếng nói của người và tiếng kêu của các loài động vật. Là loài chim chỉ thị điển hình về sự ô nhiễm môi trường.', 'DD', NULL, NULL, 'vncreatures.net'),
(3736, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Corvidae', 'Quạ', 'FAM_103', 'Crypsirina', NULL, 'GEN_0491', 'crypsirinatemia', 'Crypsirina temia', '(Daudin, 1800)            ', 'Chim khách', 'SPA_03766', 'Chim trưởng thành bộ lông nhìn chung có màu đen, các lông đuôi rất dài hình chạc, mút của phiến ngoài kéo dài ra thành dải nhọn chìa ra ngoài. Mắt đen viền màu xanh xám, mỏ khá to, mỏ trên xanh xám, mỏ dưới màu đen và chân đen. Kiếm ăn và làm tổ ở rừng trên các độ cao khác nhau từ 50 – 1000m. Có thể gặp ở cửa rừng hay trong rừng sâu kể cả rừng ngập mặn. Thường gặp 1 – 2 con kiếm ăn ở tầng thấp cách mặt đất từ 5 – 6m trong đàn hỗn hợp với một số loài khác. Chúng thường bị tấn công bởi chim chèo bẻo.', NULL, 'Nam bộ ở Tây Ninh (núi Bà Đen), Bình Dương (núi Cậu), Trà Vinh (Duyên Hải) … Thái Lan và Campuchia.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3737, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Corvidae', 'Quạ', 'FAM_103', 'Dendrocitta', NULL, 'GEN_0558', 'dendrocittaformosae', 'Dendrocitta formosae', '(Swinhoe, 1863)            ', 'Choàng choạc xám', 'SPA_03769', '33cm. Có màu xám, nâu và đen rõ rệt, đuôi dài. Khi bay lộ rõ hông trắng nhạt và trên cánh có đốm trắng. Bình thường đi theo đàn, gặp kiếm ăn ở cạnh rừng cây gỗ. Các vùng rừng và cây bụi thứ sinh. Sống định cư lên tới độ cao khoảng 2.200 mét, chủ yếu ở vùng rừng núi, không phổ biến.', NULL, 'Bắc Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3738, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Corvidae', 'Quạ', 'FAM_103', 'Dendrocitta', NULL, 'GEN_0558', 'dendrocittafrontalis', 'Dendrocitta frontalis', 'Horsfield, 1840.', 'Choàng choạc đầu đen', 'SPA_03770', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3739, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Corvidae', 'Quạ', 'FAM_103', 'Dendrocitta', NULL, 'GEN_0558', 'dendrocittavagabunda', 'Dendrocitta vagabunda', '(Latham, 1790)', 'Choàng choạc hung', 'SPA_03771', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3740, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Corvidae', 'Quạ', 'FAM_103', 'Garrulus', NULL, 'GEN_0739', 'garrulusglandarius', 'Garrulus glandarius', 'Linnaeus , 1758', 'Quạ thông', 'SPA_03772', 'Nhìn chung bộ lông có màu hung nâu nhạt, một đám lông trên cánh có màu vằn xanh lơ. Khi bay lượn, hông có màu trắng dễ thấy. Đuôi màu đen. Lông ở đỉnh đầu có khi dựng lên thành mào. Sống theo đàn nhỏ, huyên náo.  ', NULL, 'Nam Trung Bộ và Nam Bộ. Đã thu mẫu ở nhiều nơi. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3741, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Corvidae', 'Quạ', 'FAM_103', 'Pica', NULL, 'GEN_1556', 'picapica', 'Pica pica', NULL, 'Ác là', 'SPA_03773', 'Ác là có chiều dài khoảng 40–51 cm. Đầu, cổ và ngực màu đen bóng với ánh lục và tím kim loại, bụng và vai màu trắng; hai cánh màu đen và được làm bóng bằng màu xanh lục sẫm hay tía, các lông cánh có các tơ bên trong màu trắng, lộ rõ khi dang cánh ra. Đuôi xòe rộng dần màu đen, lốm đốm xanh lục-vàng đồng hay các màu ngũ sắc khác. Chân và mỏ màu đen.\nChim non trông tương tự như chim trưởng thành, nhưng không có độ bóng trên bộ lông màu đen than. Ác là đực lớn hơn một chút so với ác là cái. Bộ lông khoang nổi bật và dài (20–30 cm), đuôi xòe dần, tiếng kêu khàn khàn và to là những đặc điểm làm chúng không thể nhầm lẫn với các loài khác. Trong các khu vực nông thôn thưa thớt cây cối, ác là thường gây chú ý do chúng thường bay theo nhóm, 1 đến ba con hoặc nhiều hơn, với chuyển động nhanh, dường như là với các cánh ngắn, bay nối tiếp nhau và kêu ríu rít khi chúng bay ngang qua. Khi chúng đậu xuống thì chiếc đuôi dài ngay lập tức dựng lên để không quét đất. Không có một loại thực phẩm nguồn gốc động vật nào mà chúng lại bỏ qua; từ chim non tới trứng, thú và sâu bọ nhỏ được chúng ăn ngấu nghiến, nhưng quả sồi, hạt ngũ cốc và các thức ăn thực vật khác cũng không bị chúng từ chối. Mùa đông, ác là sống thành bầy nhỏ, đi lang thang, kiếm ăn và tụ tập lại để đậu ngủ qua đêm. Chúng cũng tụ tập thành bầy lớn để tìm bạn đời trong thời gian đầu năm. Chúng đẻ từ 5-8 trứng nhỏ (tối đa tới 10 như đã được ghi nhận); thường có màu lục-lam với các đốm xám hay nâu. Trứng đẻ trong tháng 4 và chỉ một lứa được nuôi nấng trừ khi có thảm họa xảy ra với lứa trứng ấp đầu tiên.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
(3742, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Corvidae', 'Quạ', 'FAM_103', 'Temnurus', NULL, 'GEN_1926', 'temnurustemnurus', 'Temnurus temnurus', '(Temminck, 1825)            ', 'Chim khách đuôi cờ', 'SPA_03774', 'đen nhỏ (30 cm). Với chiếc đuôi gai hình tháp độc đáo, đầu dày và đen, lông trên thân màu xám đen, mỏ dày và cong. Iris nâu; đen đen; chân đen', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Đỗ Tước và Đặng Thanh Long (2013). Chuyên đề điều tra đa dạng động vật rừng trên địa bàn thành phố Hà Nội. Chi Cục Kiểm lâm Hà Nộ'),
(3743, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Corvidae', 'Quạ', 'FAM_103', 'Urocissa', NULL, 'GEN_2017', 'urocissachinensis', 'Urocissa chinensis', 'Cabanis, 1850', 'Giẻ cùi xanh', 'SPA_03775', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3744, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Corvidae', 'Quạ', 'FAM_103', 'Urocissa', NULL, 'GEN_2017', 'urocissaerythrorhyncha', 'Urocissa erythrorhyncha', '(Boddaert, 1783)            ', 'Giẻ cùi', 'SPA_03776', ' 65cm (kể cả đuôi). Dễ phân biệt. Phía lưng có màu xanh lơ, đầu đen, mỏ và chân đỏ. Mặt bụng trắng. Đuôi rất dài, mút lông có màu trắng. Thường kiếm ăn theo đàn nhỏ.  sống: Các vùng rừng và tầng cây bụi thứ sinh.  Sống định cư, gặp tương đối phổ biến lên tới độ cao khoảng 1.500 mét.', NULL, 'Từ bắc đến nam Trung bộ . ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3745, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Corvidae', 'Quạ', 'FAM_103', 'Urocissa', NULL, 'GEN_2017', 'urocissaflavirostris', 'Urocissa flavirostris', '(Blyth, 1846)', 'Giẻ cùi mỏ vàng', 'SPA_03777', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3746, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Corvidae', 'Quạ', 'FAM_103', 'Urocissa', NULL, 'GEN_2017', 'urocissawhiteheadi', 'Urocissa whiteadi', '(Ogilvie-Grant, 1899)', 'Giẻ cùi vàng', 'SPA_03778', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3747, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Dicaeidae', 'Chim Sâu', 'FAM_122', 'Dicaeum', NULL, 'GEN_0575', 'dicaecumconcolor', 'Dicaecum concolor', 'Jerdon, 1840', 'Chim sâu vàng lục ', 'SPA_03779', 'Những con chim này rất nhỏ (dài 9 cm) và không có sự khác biệt rõ rệt giữa con đực và con cái', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3748, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Dicaeidae', 'Chim Sâu', 'FAM_122', 'Dicaeum', NULL, 'GEN_0575', 'dicaecumcruentatum', 'Dicaecum cruentatum', '(Linnaeus, 1758)', 'Chim sâu lưng đỏ ', 'SPA_03780', '9cm. Chim trống: Có màu đỏ tươi ở phía lưng kéo dài từ trán xuống gốc đuôi. Chim mái: Phía lưng có màu xanh ôliu, hông đỏ sẫm và đuôi đen; mặt bụng màu ô liu nhạt. Chim non: Không có màu đỏ thẫm nhưng mỏ màu da cam tươi. Tiếng kêu: Tiếng hót ‘si-bit si-bit’ cao; lặp đi lặp lại, và còn có tiếng ‘chip-chip chip-chip’.', NULL, 'Từ vùng Đông Bắc đến hết Nam Bộ (riêng vùng phía Nam của Trung Trung Bộ chưa tìm thấy), và Lào.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3749, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Dicaeidae', 'Chim Sâu', 'FAM_122', 'Dicaeum', NULL, 'GEN_0575', 'dicaeumagile', 'Dicaeum agile', '(Tickell, 1833            ', 'Chim sâu mỏ lớn', 'SPA_03781', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3750, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Dicaeidae', 'Chim Sâu', 'FAM_122', 'Dicaeum', NULL, 'GEN_0575', 'dicaeumchrysorrheum', 'Dicaeum chrysorrheum', '(Temminck & Laugier, 1829)          ', 'Chim sâu bụng vạch', 'SPA_03782', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3751, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Dicaeidae', 'Chim Sâu', 'FAM_122', 'Dicaeum', NULL, 'GEN_0575', 'dicaeumconcolor', 'Dicaeum concolor', '(Jerdon, 1840)            ', 'Chim sâu vàng lục', 'SPA_03783', '8cm. Kích thước rất nhỏ, trông có màu xám, mặt bụng sáng hơn, mắt đen. Chim non có mỏ đen.', NULL, 'Ba Vì', NULL, NULL, NULL, NULL, NULL, NULL, 'Đỗ Tước và Đặng Thanh Long (2013). Chuyên đề điều tra đa dạng động vật rừng trên địa bàn thành phố Hà Nội. Chi Cục Kiểm lâm Hà Nội'),
(3752, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Dicaeidae', 'Chim Sâu', 'FAM_122', 'Dicaeum', NULL, 'GEN_0575', 'dicaeumcruentatum', 'Dicaeum cruentatum', '(Linnaeus, 1758)            ', 'Chim sâu lưng đỏ', 'SPA_03784', '9cm. Chim trống: Có màu đỏ tươi ở phía lưng kéo dài từ trán xuống gốc đuôi. Chim mái: Phía lưng có màu xanh ôliu, hông đỏ sẫm và đuôi đen; mặt bụng màu ô liu nhạt. Chim non: Không có màu đỏ thẫm nhưng mỏ màu da cam tươi. sống: Vùng cây bụi thứ sinh, bụi rậm, gần chỗ đất trồng trọt, vườn làng và thành phố. Sống định cư ở độ cao trên khoảng 1.200 mét. Thường gặp phổ biến.', NULL, 'Từ vùng Đông Bắc đến hết Nam Bộ (riêng vùng phía Nam của Trung Trung Bộ chưa tìm thấy), và Lào. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3753, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Dicaeidae', 'Chim Sâu', 'FAM_122', 'Dicaeum', NULL, 'GEN_0575', 'dicaeumignipectus', 'Dicaeum ignipectus', '(Blyth, 1843)', 'Chim sâu ngực đỏ', 'SPA_03785', '9cm. Chim trống: Phần thân trên xanh lục ánh thép và có một mảng đỏ tươi trước ngực. Chim mái: Phân biệt bởi mặt bụng phớt hung. Tiếng kêu: ỏsiõ lặp đi lặp lại, giọng cao và âm vang ỏchip chip chipõ.', NULL, 'Các vùng (trừ Nam của Trung Trung Bộ và Nam Bộ là chưa tìm thấy).', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3754, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Dicaeidae', 'Chim Sâu', 'FAM_122', 'Dicaeum', NULL, 'GEN_0575', 'dicaeummelanoxanthum', 'Dicaeum melanoxanthum', '(Blyth, 1843)', 'Chim sâu lung đỏ', 'SPA_03786', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3755, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Dicaeidae', 'Chim Sâu', 'FAM_122', 'Dicaeum', NULL, 'GEN_0575', 'dicaeumminullum', 'Dicaeum minullum', 'Jerdon , 1840', 'Chim sâu vàng lục', 'SPA_03787', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3756, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Dicruridae', 'Chèo Bẻo', 'FAM_124', 'Dicrurus', NULL, 'GEN_0580', 'dicrurusaeneus', 'Dicrurus acneus', 'Vieillot, 1817.', 'Chèo bèo rừng ', 'SPA_03788', 'Đuôi thon và chẻ đôi với các lông đuôi bên ngoài hơi xòe ra phía ngoài. Những con chưa trưởng thành có nách có màu trắng. Chim non có màu xỉn hơn và có màu nâu và ít đốm hơn', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3757, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Dicruridae', 'Chèo Bẻo', 'FAM_124', 'Dicrurus', NULL, 'GEN_0580', 'dicrurusannectans', 'Dicrurus annectans', 'Dicrurus annectans', 'Chèo bẻo mỏ quạ', 'SPA_03789', '27-32cm. Nhìn chung giống các loài chèo bẻo khác, nhưng đuôi rộng, chẻ đôi nông, hai mút đuôi cong lên nhiều, mỏ dài, gốc mỏ rộng. Chim non có vằn trắng ở mặt bụng. sống: Các vùng rừng, lên tới độ cao khoảng 1.200 mét. Sống định cư, làm tổ, gặp phổ biến.', NULL, 'Các vùng trong cả nước, trừ Tây Bắc. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3758, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Dicruridae', 'Chèo Bẻo', 'FAM_124', 'Dicrurus', NULL, 'GEN_0580', 'dicrurusbracteatus', 'Dicrurus bracteatus', '(Gould, 1842)', 'Chèo bẻo bờm', 'SPA_03790', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3759, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Dicruridae', 'Chèo Bẻo', 'FAM_124', 'Dicrurus', NULL, 'GEN_0580', 'dicrurushottentottus', 'Dicrurus hottentottus', '(Linnaeus, 1766)            ', 'Chèo bẻo bờm', 'SPA_03791', '32cm. Lông đuôi ngoài vểnh cao (thấy rõ nhất khi bay), mỏ khỏe, màu lông xanh ánh thép, có mào lông ở trán và đỉnh đầu sống: Các vùng rừng và cây bụi thứ sinh. Có các chủng quần sống định cư và di cư. Gặp khá phổ biến lên đến độ cao khoảng 2.400 mét.', NULL, 'Khắp các vùng. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3760, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Dicruridae', 'Chèo Bẻo', 'FAM_124', 'Dicrurus', NULL, 'GEN_0580', 'dicrurusleucophaeus', 'Dicrurus leucophacus', 'Vieillot, 1817', 'Chèo bèo xám ', 'SPA_03792', '29cm. Có một số phân loài khác nhau, nhưng nhìn chung về hình dáng tương tự như Chèo bẻo đen Dicrurus macrocercus, nhưng màu lông từ xám nhạt đến xám ánh thép thẫm. Mặt bụng màu xỉn hơn. Loài phụ Chèo bẻo xám má trắng leucogenis có màu xám nhạt, loài phụ salangenis màu xám đậm toàn thân và loài phụ hopwoodi có màu sẫm hơn. Tiếng kêu: ‘Meo meo đặc trưng.', NULL, 'Khắp các vùng trong nước.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3761, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Dicruridae', 'Chèo Bẻo', 'FAM_124', 'Dicrurus', NULL, 'GEN_0580', 'dicrurusmacrocercus', 'Dicrurus macrocercus', '(Vieillot, 1817)            ', 'Chèo bẻo', 'SPA_03793', '28cm. Đuôi chẻ sâu, hai mép ngoài chỉ hơi vểnh lên, khác với đuôi chẻ ở Chèo bẻo bờm. Lông mặt bụng của con non phớt trắng. Đậu ở tầm cao, thường gặp trên dây điện và lưng gia súc. Bay thành hình lượn sóng, đi đôi hay đàn. sống: Các vùng đồng bằng, thành thị, và cả ở vùng xình lầy, ngập nước. Thích ở nơi trống trải có cây cao mọc rải rác, và đặc biệt tập trung thành đàn lớn trên các đảo lớn ngoài khơi. Có các quần thể sống định cư và di cư đến vào mùa đông. Gặp phổ biến lên đến độ cao khoảng 1.200 mét.', NULL, 'Khắp các vùng. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3762, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Dicruridae', 'Chèo Bẻo', 'FAM_124', 'Dicrurus', NULL, 'GEN_0580', 'dicrurusparadiseus', 'Dicrurus paradiseus', '(Linnaeus, 1766)            ', 'Chèo bẻo cờ đuôi chẻ', 'SPA_03794', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3763, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Dicruridae', 'Chèo Bẻo', 'FAM_124', 'Dicrurus', NULL, 'GEN_0580', 'dicrurusremifer', 'Dicrurus remifer', '(Temminck, 1823)            ', 'Chèo Bẻo đuôi cờ', 'SPA_03795', 'Trán, trước mắt, cằm và má đen nhung. Mặt, cánh, đuôi, họng, cổ và ngực đen có ánh xanh lục, đầu và ngực hơi có ánh tím. Lông dưới cánh và nách có dải viền trắng hẹp. Mắt đỏ. Mỏ và chân đen. Cánh: 129 - 146; đuôi: 350 - 400; dải cờ: 70 - 80; giò: 21 - 22; mỏ: 21 - 23mm ', NULL, 'Các rừng miền Bắc từ biên giới Trung - Việt trở vào đến khoảng Thừưa Thiên Bắc Ấn Độ, Miến Điện, Tây Nam Trung Quốc, Thái Lan và Bắc Đông Dương', NULL, NULL, 'Có giá trị khoa học và thẩm mỹ. Là đối tượng nghiên cứu khoa học và giúp cân bằng sinh thái trong tự nhiên', NULL, NULL, NULL, 'VnCreature'),
(3764, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Emberizidae', 'Sẻ Đồng', 'FAM_133', 'Emberiza', NULL, 'GEN_0644', 'emberizaaureola', 'Emberiza aureola', 'Pallas, 1773            ', 'Sẻ đồng ngực vàng', 'SPA_03796', '15cm. Chim trống trưởng thành: Mặt đen, phần dưới cơ thể vàng, có dải ngực và phía lưng màu hung, có mảng vai trắng rất rõ. Chim mái và chim trống ngoài mùa sinh sản: Toàn bộ mặt màu đen và không có dải ngực màu hung và màu vàng ở mặt bụng nhạt hơn. Chim non: Có màu giống chim mái nhưng phần dưới cơ thể nâu hơi sẫm và có nhiều vạch trên ngực. Nhìn chung bộ lông có vạch ở sườn và ít nhiều có màu trắng ở đuôi. sống: Các vùng đồng cỏ, bụi rậm, nơi thoáng đãng, gần nguồn nước. Ngủ trong vùng lau sậy theo đàn lớn. Có thể gặp tương đối phổ biến. Sinh cảnh sống: Các vùng đồng cỏ, bụi rậm, nơi thoáng đãng, gần nguồn nước. Ngủ trong vùng lau sậy theo đàn lớn. Có thể gặp đến độ cao gần 1.400 mét. Di cư đến vào mùa đông', NULL, ' ', NULL, NULL, NULL, NULL, 'CR', NULL, 'Vietnam Bird Guide'),
(3765, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Emberizidae', 'Sẻ Đồng', 'FAM_133', 'Emberiza', NULL, 'GEN_0644', 'emberizafucata', 'Emberiza fucata', 'Pallas, 1776            ', 'Sẻ đồng đầu xám', 'SPA_03797', '15-16cm. Nhìn chung bộ lông có má hay vùng tai và vai màu hung. Các sọc đen chạy dọc lưng và ngực. Chim trống trưởng thành đỉnh đầu có vạch màu xám tối, phía dưới ở vùng trước ngực có dải hung, sườn có vạch. Trong trường hợp khác bộ lông không có dải hung ở ngực, và màu ở đầu hơi nâu. sống: Thấy ở các vùng đất trống trải, ven đồi, vùng đầm lầy và ruộng lúa. Loài chim di cư đến vào mùa đông, không phổ biến.', NULL, 'Bắc Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3766, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Emberizidae', 'Sẻ Đồng', 'FAM_133', 'Emberiza', NULL, 'GEN_0644', 'emberizapusilla', 'Emberiza pusilla', 'Pallas, 1776', 'Sẻ đồng lùn', 'SPA_03798', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3767, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Emberizidae', 'Sẻ Đồng', 'FAM_133', 'Emberiza', NULL, 'GEN_0644', 'emberizarutila', 'Emberiza rutila', 'Pallas, 1776', 'Sẻ đồng hung', 'SPA_03799', '14cm. Chim trống: Đầu và lưng hung nâu đỏ, mặt bụng vàng. Mùa đông có màu hung nhạt lẫn các vằn nhỏ lốm đốm, đa dạng, ngực có dải vàng và hung. Chim mái, chim non, và chim trống ở mùa đông đầu tiên: Phía lưng nâu có kẻ sọc, mặt bụng vàng nhạt. Chim non có kẻ sọc trên ngực nổi bật hơn. sống: Thích vùng bìa rừng và đôi khi thấy ở vùng đất trồng trọt.', NULL, 'Các vùng trong cả nước. Di cư đến vào mùa đông, khá phổ biến. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3768, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Emberizidae', 'Sẻ Đồng', 'FAM_133', 'Emberiza', NULL, 'GEN_0644', 'emberizaspodocephala', 'Emberiza spodocephala', 'Pallas, 1776', 'Sẻ đồng mặt đen', 'SPA_03800', 'Chim trống thuộc phân loài sordida đầu và ngực màu xanh ô liu, mặt đen nhạt, bụng và dưới đuôi vàng. Phân loài spodocephala: Mặt bụng trắng, đầu và họng xám. Phân loài personata: Mặt bụng vàng xám có sọc nâu, đầu xanh lục xám. Chim mái và chim non: Khó xác định và có hình dạng khác nhau. Khi bị kích động, lông đỉnh đầu dựng lên tạo thành mào lông. Đuôi luôn cử động để lộ các lông mặt ngoài đuôi trắng.  ', NULL, 'Bắc Bộ và Bắc Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3769, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Emberizidae', 'Sẻ Đồng', 'FAM_133', 'Emberiza', NULL, 'GEN_0644', 'emberizatristrami', 'Emberiza tristrami', 'Swinhoe, 1870', 'Sẻ đồng', 'SPA_03801', 'Đầu đen có nhiều sọc trắng nổi bật, đen nhạt hơn ở chim mái, sườn nâu có các sọc đen mảnh, hông và đuôi hung nâu. Vào mùa đông khó phân biệt hơn màu lông của chim mái và chim trống. Con non có màu lông giống con mái.  ', NULL, 'Bắc Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3770, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Emberizidae', 'Sẻ Đồng', 'FAM_133', 'Melophus', NULL, 'GEN_1201', 'melophuslathami', 'Melophus lathami', '(J.F. Gray, 1831)           ', 'Sẻ đồng mào', 'SPA_03802', '17cm. Chim trống có màu hung nâu thẫm và đen dễ phân biệt. Bộ lông đen có vảy nâu vào mùa đông. Chim mái có màu xám xịt hơn. Có mào ngắn. Vùng đất trồng trọt, cây bụi và cỏ tốt. Ngủ theo đàn. Định cư, không hoàn toàn phổ biến.', NULL, 'Bắc Bộ và Bắc Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Birdwatchingvietnam'),
(3771, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Emberizidae', 'Sẻ Đồng', 'FAM_133', 'Mycerobas', NULL, 'GEN_1267', 'mycerobasmelanozanthos', 'Mycerobas melanozanthos', '(Hodgson, 1836)', 'Mỏ to cánh đốm', 'SPA_03803', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3772, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Estrildidae', 'Chim Di', 'FAM_139', 'Amandava', NULL, 'GEN_0069', 'amandavaamandava', 'Amandava amandava', '(Linnaeus, 1758)            ', 'Mai hoa', 'SPA_03804', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3773, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Estrildidae', 'Chim Di', 'FAM_139', 'Lonchura', NULL, 'GEN_1103', 'lonchuramaja', 'Lonchura maja', '(Linnaeus, 1766)', 'Di đầu trắng ', 'SPA_03805', '10cm. Mỏ màu xanh lơ. Con trưởng thành: Đầu trắng dễ phân biệt, trừ vài trường hợp cá biệt. Chim non: Màu nhạt hơn, hai bên đầu có vòng phớt trắng.', NULL, 'Nam Trung Bộ và Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/science-name/white-headed-munia-1003'),
(3774, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Estrildidae', 'Chim Di', 'FAM_139', 'Lonchura', NULL, 'GEN_1103', 'lonchuramalacca', 'Lonchura malacca', '(Linnaeus, 1766)            ', 'Di đầu đen', 'SPA_03806', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3775, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Estrildidae', 'Chim Di', 'FAM_139', 'Lonchura', NULL, 'GEN_1103', 'lonchurapunctulata', 'Lonchura punctulata', '(Linnaeus, 1758)            ', 'Di đá', 'SPA_03807', '11cm. Con trưởng thành: Ngực và phần dưới cơ thể có hình vảy. Chim non: Nâu trơn, không có vảy sống: Khắp các vùng cây bụi, nơi trồng trọt và đồng ruộng. Loài định cư phổ biến. Có thể gặp lên tới độ cao gần 1.700 mét. Di chuyển theo đàn đông, kêu liên tục khi bay, thỉnh thoảng có lẫn loài di khác vào đàn.', NULL, 'Khắp các vùng. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3776, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Estrildidae', 'Chim Di', 'FAM_139', 'Lonchura', NULL, 'GEN_1103', 'lonchurastriata', 'Lonchura striata', '(Linnaeus, 1766)            ', 'Di cam', 'SPA_03808', ' 11cm. Đuôi nhọn. Chim trưởng thành: Lưng nâu, có vạch nhỏ, tối màu hơn Di đá, có hông trắng và đuôi đen. Chim non: Nhạt màu hơn và màu hông không hoàn toàn trắng.  sống: Cây bụi thứ sinh, đồng cỏ, nơi trồng trọt và những chỗ trống trải khác, có thể gặp lên đến độ cao khoảng 1.800 mét. Sống định cư, luôn đi theo đàn, phổ biến.', NULL, ' Khắp các vùng. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3777, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Eurylaimidae', 'Mỏ Rộng', 'FAM_145', 'Calyptomena', NULL, 'GEN_0296', 'calyptomenaviridis', 'Calyptomena viridis', 'Raffles, 1822', 'Mỏ rộng xồm', 'SPA_03809', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3778, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Eurylaimidae', 'Mỏ Rộng', 'FAM_145', 'Corydon', NULL, 'GEN_0471', 'corydonsumatranus', 'Corydon sumatranus', '(Raffles, 1822)            ', 'Mỏ rộng đen', 'SPA_03810', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3779, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Eurylaimidae', 'Mỏ Rộng', 'FAM_145', 'Cymbirhynchus', NULL, 'GEN_0529', 'cymbirhynchusmacrorhynchos', 'Cymbirhynchus macrorhynchos', '(Gmelin, 1788)', 'Mỏ rộng đỏ', 'SPA_03811', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3780, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Eurylaimidae', 'Mỏ Rộng', 'FAM_145', 'Eurylaimus', NULL, 'GEN_0699', 'eurylaimusjavanicus', 'Eurylaimus javanicus', '(Horsfield, 1821).', 'Mỏ rộng hồng', 'SPA_03812', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3781, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Eurylaimidae', 'Mỏ Rộng', 'FAM_145', 'Psarisomus', NULL, 'GEN_1642', 'psarisomusdalhousiae', 'Psarisomus dalhousiae', '(Jameson, 1835)            ', 'Mỏ rộng xanh', 'SPA_03813', 'Chim trưởng thành bộ lông có màu xanh lục thẫm, đầu và gày có màu đen, hai bên gáy có hai vệt vàng nhạt. Mặt, họng, vòng cổ vàng nghệ. Lông cánh sơ cấp và thứ cấp màu đen, xanh lục và lúc bay nhìn thấy có vệt trắng. Lông đuôi dài và hẹp, có màu xanh thẫm ở trên và đen ở dưới. Chim non có màu tối hơn và đầu xanh. Tổ hình quả bầu hơi dài, có cửa một bên, treo bằng sơi dây ở đầu cành nhỏ của các cây gỗ lớn. Vật liệu làm tổ là lá khô, cỏ, dây leo và sợi vỏ cây. Mỗi lứa đẻ từ 4 - 8 trứng, vỏ trứng màu trắng có đốm hung (Baker, 1926). Quan sát tổ và chim non rời tổ vào tháng 7 ở Lạng Sơn (Hữu Lũng). Thức ăn là côn trùng. Chim sống định cư và làm tổ ở rừng rậm những nơi có độ cao khoảng dướí 1500 - 1800m. Thường gặp kiếm ăn và làm tổ ở tầng trên của rừng.', NULL, 'Từ biên giới Việt Trung đến Thừa Thiên - Huế. Phía nam Trung bộ là vùng phân bố của phân loài thứ 2 (Psarisomus dalhousiae divinus)  Hymalaia, Mianma, nam Trung Quốc, Đông Dương, Thái Lan.', NULL, NULL, 'Nguồn gen quý. Có giá trị khoa học và thẩm mỹ.', 'T', NULL, NULL, 'vncreatures'),
(3782, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Eurylaimidae', 'Mỏ Rộng', 'FAM_145', 'Serilophus', NULL, 'GEN_1807', 'serilophuslunatus', 'Serilophus lunatus', '(Gould, 1834)            ', 'Mỏ rộng hung', 'SPA_03814', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3783, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Fringillidae', 'Sẻ Thông', 'FAM_152', 'Carduelis', NULL, 'GEN_0316', 'carduelisambigua', 'Carduelis ambigua', '(Oustalet, 1896)', 'Sẻ đồng đầu đen', 'SPA_03815', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3784, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Fringillidae', 'Sẻ Thông', 'FAM_152', 'Carpodacus', NULL, 'GEN_0319', 'carpodacuserythrinus', 'Carpodacus erythrinus', '(Pallas, 1770)            ', 'Sẻ hồng Mura', 'SPA_03816', '16cm. Chim trống: Đầu, ngực và hông có màu đỏ dễ nhận biết. Chim trống và chim mái ở mùa đông đầu tiên: Không được mô tả, nhưng thấy có hai dải nâu ở cánh. Các con mái và con non nói chung thường đi theo đàn nhỏ và nếu trong đó có con trống trưởng thành thì dễ dàng xác định. sống: Vùng cửa rừng, rừng thứ sinh và cây bụi cũng như vùng đất canh tác lên đến độ cao khoảng 2.500 mét. Gặp ở vùng phân bố vào mùa đông.', NULL, 'Tây Bắc. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3785, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Fringillidae', 'Sẻ Thông', 'FAM_152', 'Carpodacus', NULL, 'GEN_0319', 'carpodacussp', 'Carpodacus sp.', NULL, 'Sẻ hồng', 'SPA_03817', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3786, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Fringillidae', 'Sẻ Thông', 'FAM_152', 'Eophona', NULL, 'GEN_0654', 'eophonamigratoria', 'Eophona migratoria', 'Hartert, 1903', 'Mỏ to đầu đen', 'SPA_03818', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3787, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Hirundinidae', 'Nhạn', 'FAM_186', 'Cecropis', NULL, 'GEN_0334', 'cecropisbadia', 'Cecropis badia', 'Cassin, 1853', 'Nhạn bụng hung ', 'SPA_03819', 'Nó có những vệt mờ nhạt ở phần dưới lông xù sâu và phần mông không có vệt. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3788, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Hirundinidae', 'Nhạn', 'FAM_186', 'Cecropis', NULL, 'GEN_0334', 'cecropisdaurica', 'Cecropis daurica', '(Laxmann, 1769)            ', 'Nhạn bụng xám', 'SPA_03820', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3789, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Hirundinidae', 'Nhạn', 'FAM_186', 'Cecropis', NULL, 'GEN_0334', 'cecropisstriolata', 'Cecropis striolata', '(Schlegel, 1844)            ', 'Nhạn bụng vằn', 'SPA_03821', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3790, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Hirundinidae', 'Nhạn', 'FAM_186', 'Delichon', NULL, 'GEN_0555', 'delichondasypus', 'Delichon dasycus', '(Bonaparte, 1850)', 'Nhạn hông trắng Á Châu', 'SPA_03822', '13cm. Dễ dàng nhận biết bởi hông màu trắng và bong bóng đôi nông. Phần lớn chúng màu lông dưới thân xám. sống: Kiếm ăn trên các vùng rừng núi và đồng bằng. Đây là loài di cư, ít gặp.', NULL, ' Nam Trung Bộ (quan sát ở Đắc Lắc vào năm 1998) và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3791, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Hirundinidae', 'Nhạn', 'FAM_186', 'Delichon', NULL, 'GEN_0555', 'delichonnipalensis', 'Delichon nipalensis', 'Moore, 1854', 'Nhạn hông trắng Nê Pan', 'SPA_03823', 'Chim trưởng thành công: Đầu và hai bên đầu, cổ, lưng, vai, bao cánh, lông bao trên đuôi dài nhất và đuôi đen có ánh xanh. Các lông phía sau cổ có gốc trắng và thường lộ ra bên ngoài như một vòng cổ không kín. Hồng trắng. Các loại lông bao đuôi ngắn có màu đen. Cánh cánh đen có ánh xanh ở rìa ngoài. Má, tai, nhổ và bóng tròn, thường có các khoảng trống. Black tail có ánh xanh. Phần còn lại của vùng bụng. Nách và dưới cánh đen.Mắt nâu. Mỏ nâu đen hay đen nhạt. Chân trắng hồng. Kích thước: Cánh: 94 - 98; lứa: 38 - 41; giò: 10 - 11; Moi: 6mm ', NULL, 'ở Lào Cai. loài này phân bố Himalaya, Axám và Bắc Miến Điện', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3792, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Hirundinidae', 'Nhạn', 'FAM_186', 'Delichon', NULL, 'GEN_0555', 'delichonurbica', 'Delichon urbica', '(Linnaeus, 1758).', 'Nhạn hông trắng Xibêri', 'SPA_03824', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3793, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Hirundinidae', 'Nhạn', 'FAM_186', 'Hirundo', NULL, 'GEN_0888', 'hirundoconcolor', 'Hirundo concolor', '(Sykes, 1832)', 'Nhạn bụng nâu', 'SPA_03825', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3794, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Hirundinidae', 'Nhạn', 'FAM_186', 'Hirundo', NULL, 'GEN_0888', 'hirundodaurica', 'Hirundo daurica', 'Laxmann, 1769', 'Nhạn bụng xám', 'SPA_03826', '18cm (không kể lông đuôi). Khác biệt với Nhạn bụng bởi hông có màu nhạt hơn, thường là màu hơi đỏ và kích thước lớn hơn. No space khi xòe đuôi. Các phần bên dưới có các màu sắc khác nhau. sống: Thường gặp ở những nơi trống trải.', NULL, ' Khắp các vùng trong cả nước ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3795, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Hirundinidae', 'Nhạn', 'FAM_186', 'Hirundo', NULL, 'GEN_0888', 'hirundorustica', 'Hirundo rustica', '(Linnaeus, 1758)            ', 'Nhạn bụng trắng', 'SPA_03827', 'Chim trưởng thành: Trán hung nâu thẫm. Phần còn lại của toàn mặt lưng kể cả bao cánh đen có ánh xanh. Lông cánh và lông đuôi đen có anh lục. Tất cả các lông đuôi trừ đuôi giữa đều có vệt trắng ở phiến lông trong. Trước mắt đen. Cằm, họng và cả phần trên ngực hung nâu hơi nhạt hơn ở trán. Ngang trước ngực có dải rộng màu đen ánh xanh (thỉnh thoảng có trường hợp dải này bị ngắt đoạn giữa). Toàn bộ phần còn lại của mặt bụng trắng. Chim non: Nhìn chung giống Chim trưởng thành nhưng mặt lưng nâu thẫm lông đuôi hai bên ngắn. Mắt nâu thẫm. Mỏ đen. Chân đen. Kích thước: Cánh 104 - 125; đuôi đực: 64 - 106; cái: 56 - 81; giò: 9 - 10; mỏ: 6 - 9mm. ', NULL, 'Việt Nam có thể gặp khắp các vùng từ đồng bằng đến miền núi. Loài nhạn này phân bố ở Đông và Đông Bắc Liên Xô, Nhật Bản, Triều Tiên, mùa Đông di cư xuống phía Nam đến Ấn Độ, Miến Điện, Thái Lan, Đông Dương, Mã Lai, Bronêô, Java, Xunmatra và Tân Ghinê', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3796, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Hirundinidae', 'Nhạn', 'FAM_186', 'Hirundo', NULL, 'GEN_0888', 'hirundostriolata', 'Hirundo striolata', 'Temminck & Schlegel, 1847', 'Nhạn bụng vằn', 'SPA_03828', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3797, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Hirundinidae', 'Nhạn', 'FAM_186', 'Hirundo', NULL, 'GEN_0888', 'hirundotahitica', 'Hirundo tahitica', 'Gmelin, 1789', 'Nhạn đuôi đen', 'SPA_03829', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3798, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Hirundinidae', 'Nhạn', 'FAM_186', 'Riparia', NULL, 'GEN_1755', 'ripariariparia', 'Riparia riparia', '(Linnaeus, 1758)', 'Nhạn nâu xám', 'SPA_03830', '13cm. Phía lưng và dải lông trước màu nâu. Chim không có màu nâu đỏ. Xình đỏ, sông và dọc bãi cát. Di cư, ít gặp.', NULL, ' Bắc Bộ, Nam Trung Bộ và Nam Bộ. Gặp nhiều nơi ở đồng bằng sông Cửu Long (1999). ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3799, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Irenidae', 'Chim Xanh', 'FAM_199', 'Irena', NULL, 'GEN_0970', 'irenapuella', 'Irena puella', '(Latham, 1790)            ', 'Chim lam', 'SPA_03831', 'Cồng kềnh và đặc biệt, con đực chủ yếu có màu đen với phần trên và lỗ huyệt màu xanh đậm sáng bóng trong khi con cái có tổng thể màu xanh ngọc lam xỉn hơn. Tròng đen màu đỏ tươi có ở cả hai giới. sống: Rừng và ven rừng', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Birds of Singapore'),
(3800, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Laniidae', 'Bách Thanh', 'FAM_210', 'Lanius', NULL, 'GEN_1029', 'laniusbucephalus', 'Lanius bucephalus', 'Temminck & Schlegel, 1845.', 'Bách thanh đầu nâu', 'SPA_03832', '20cm. Đầu to, lông màu hung sáng, tương tự ở sườn vào mùa đông, tương phản với màu xám ở lưng và hông. Vào mùa hè màu nhạt hơn, phía bụng trắng. Chim mái có màu nhạt hơn, mặt bụng có sọc, nhưng không có sừng trắng ở cánh như chim trống.  sống: Chỗ trống, vùng cửa rừng, phân bố đến độ cao 750 mét.', NULL, 'Trung Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3801, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Laniidae', 'Bách Thanh', 'FAM_210', 'Lanius', NULL, 'GEN_1029', 'laniuscollurioides', 'Lanius collurioides', 'Lesson, 1834            ', 'Bách thanh nhỏ', 'SPA_03833', '20cm. So với Bách thanh đuôi dài, tuy giống nhưng kích thước nhỏ hơn, ngực và bụng không trắng mà phớt hung, bao đuôi và sườn không có màu hung nâu. sống: Vùng cây bụi và khu vực trồng trọt. Làm tổ ở vùng núi nhưng mùa đông di cư xuống đai thấp. Sống định cư, phổ biến, gặp lên đến độ cao khoảng 1.800 mét.', NULL, 'Các vùng trong cả nước, tuy nhiên chưa tìm thấy ở Trung Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3802, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Laniidae', 'Bách Thanh', 'FAM_210', 'Lanius', NULL, 'GEN_1029', 'laniuscristatus', 'Lanius cristatus', 'Linnaeus, 1758            ', 'Bách thanh mày trắng', 'SPA_03834', '20cm. Có một số phân loài di cư đến vào mùa đông, màu sắc có thể thay đổi ít nhiều, nhưng thường gặp chim có màu hung nâu ở đầu và lưng, mặt bụng trắng. Bộ lông con non có hình vảy mờ bên ngực và sườn. Nhút nhát và thường đậu chỗ khuất.  sống: Chỗ trống trải, vùng cây bụi thứ sinh và bản làng. Thường gặp xung quanh rừng tràm, vùng đồng cỏ và cây bụi ở đồng bằng sông Cửu Long. Loài di cư', NULL, ' Xuất hiện vào mùa đông ở các vùng, trừ Tây Bắc. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3803, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Laniidae', 'Bách Thanh', 'FAM_210', 'Lanius', NULL, 'GEN_1029', 'laniusschach', 'Lanius schach', 'Linnaeus, 1758            ', 'Bách thanh đầu đen', 'SPA_03835', ' 25cm. Đuôi dài. Đầu xám, lưng màu hung nâu, cánh và đuôi đen. Bộ lông chim non có vạch kẻ mờ. Dạng bách thanh trung gian có màu đen nhạt, ít gặp. Tiếng kêu: Đa dạng, có thể nhại tiếng hót của một số loài chim khác. sống: Khu vực trống trải và vùng cây bụi. Sống định cư phổ biến, gặp lên tới độ cao khoảng trên 2.000 mét.', NULL, 'Từ Bắc Bộ đến hết Trung Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3804, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Laniidae', 'Bách Thanh', 'FAM_210', 'Lanius', NULL, 'GEN_1029', 'laniustephronotus', 'Lanius tephronotus', '(Vigors, 1831)            ', 'Bách thanh lưng xám', 'SPA_03836', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3805, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Laniidae', 'Bách Thanh', 'FAM_210', 'Lanius', NULL, 'GEN_1029', 'laniustigrinus', 'Lanius tigrinus', 'Drapiez, 1828', 'Bách thanh vằn', 'SPA_03837', '19cm. Khác các loài bách thanh khác ở chỗ màu lông của chim trống có vằn ở lưng, ở chim mái có vằn ở cả mặt bụng, vùng tai và má. Con non màu nâu tối, có vằn.  sống: Vùng cây bụi thứ sinh rậm rạp, và rừng, thường đậu dưới tán cây. Loài di cư, gặp ở đai thấp, tương đối hiếm.', NULL, 'khắp nơi. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3806, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Leiothrichidae', 'Khướu', 'FAM_214', 'Pterorhinus', NULL, 'GEN_1679', 'pterorhinuschinensis', 'Pterorhinus chinensis', '(Scopoli, 1786)', 'Khướu bạc má', 'SPA_03838', 'Mô tả: 27cm. Khi bay nhìn xa có màu đen, má trắng nổi bật. Tiếng kêu : Tiếng kêu đa dạng, du dương, nghe có tiếng \`di-iơ-boi di-iơ-boi\` lặp đi lặp lại; khá giống tiếng hót của chim Họa mi. Cây cảnh phổ biến.', NULL, 'Phân vùng: Tất cả các vùng.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/bird/black-throated-laughingthrush-862'),
(3807, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Locustellidae', 'Chim Chích', 'FAM_219', 'Locustella', NULL, 'GEN_1100', 'locustellacerthiola', 'Locustella certhiola', '(Pallas, 1811).', 'Chích mày đen', 'SPA_03839', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3808, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Locustellidae', 'Chim Chích', 'FAM_219', 'Locustella', NULL, 'GEN_1100', 'locustellalanceolata', 'Locustella lanceolata', 'Adult.', 'Chích đầm lầy nhỏ', 'SPA_03840', '13cm. Trông nhỏ và đen hơn Chích đầm lầy lớn, không có màu sắc tương phản giữa đỉnh đầu và lưng, lông mày vừa phải. Chim trưởng thành: Phía lưng màu nâu tối, có nhiều sọc. Phía bụng sọc đậm hơn ở ngực và sườn. Đuôi đồng màu, mút đuôi không trắng. Chim ở mùa đông đầu tiên: Phía bụng phớt vàng. sống: Bãi cỏ, lau sậy và quanh chỗ trồng trọt ẩm ướt. Sống chui rúc, ít khi xuất hiện ở chỗ trống.  Loài di cư và thường gặp phổ biến lên tới độ cao khoảng 1.500 mét.O411', NULL, 'Từ Đông Bắc đến hết Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3809, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Locustellidae', 'Chim Chích', 'FAM_219', 'Locustella', NULL, 'GEN_1100', 'locustellaluteoventris', 'Locustella luteoventris', '(Hodgson, 1845).', 'Chích bụi rậm nâu', 'SPA_03841', '14cm. Chim trưởng thành mặt lưng, cánh và đuôi hung nâu nhạt, sườn và ngực hung nâu nhạt, cằm họng và bụng trắng. Mỏ đen nhạt với mép mỏ vàng. sống: Chỗ cây bụi thấp, vùng cửa rừng, bãi cỏ. Phân bố ở độ cao khoảng 1.800-2.600 mét, có thể xuống thấp đến 800 mét vào mùa đông.', NULL, 'Tây Bắc. Trước đây đã thu mẫu ở một số nơi như Lào Cai, Yên Bái. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3810, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Locustellidae', 'Chim Chích', 'FAM_219', 'Locustella', NULL, 'GEN_1100', 'locustellatacsanowskia', 'Locustella tacsanowskia', '(Swinhoe, 1871). ', 'Chích ngực hung', 'SPA_03842', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3811, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Monarchidae', 'Rẻ Quạt', 'FAM_246', 'Hypothymis', NULL, 'GEN_0939', 'hypothymisazurea', 'Hypothymis azurea', '(Boddaert, 1783)            ', 'Đớp ruồi xanh gáy đen', 'SPA_03843', ' 17cm. Đầu và mỏ có màu xanh da trời, bụng trắng nhạt. Tư thế đậu ngang bằng; đuôi dài, thỉnh thoảng xòe hình nan quạt. Chim trống: Màu xanh nhiều hơn chim cái, gáy đen nhung và vòng cổ họng đen. Chim mái: Lưng, cánh và đuôi có màu nâu xám nhạt. Thường sống đơn độc nhưng thỉnh thoảng gặp đi thành đôi.  sống: Rừng, vùng cây bụi và tre nứa. Thường gặp ở tầng cây thấp, trong vườn và bìa rừng. Sống định cư phổ biến, gặp đến độ cao khoảng 1.200 mét.', NULL, 'Khắp các vùng rừng núi. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3812, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Monarchidae', 'Rẻ Quạt', 'FAM_246', 'Rhipidura', NULL, 'GEN_1734', 'rhipiduraalbicollis', 'Rhipidura albicolli', '(Vieillot, 1818)', 'Rẻ quạt họng trắng', 'SPA_03844', '19cm. Đuôi dài, rộng và bầu, hay vểnh lên và xòe hình nan quạt. Cánh ngắn và tròn. Bộ lông có màu xám đen nhạt. Họng, lông mày và mút đuôi màu trắng. Hay đi trong đàn hỗn hợp. sống: Rừng thường xanh. Tìm thấy ở tầng cây thấp và tầng dưới tán vùng cao. Sống định cư, thường gặp phổ biến ở độ cao khoảng từ 600-2.400 mét.', NULL, 'Từ Bắc Bộ đến hết Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3813, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Monarchidae', 'Rẻ Quạt', 'FAM_246', 'Rhipidura', NULL, 'GEN_1734', 'rhipiduraaureola', 'Rhipidura aureola', 'Lesson , 1830', 'Rẻ quạt mày trắng', 'SPA_03845', 'Đuôi quạt lông mày trắng trưởng thành dài khoảng 18 cm. Nó có phần trên màu nâu sẫm, có những đốm trắng trên cánh và phần dưới màu trắng. Đuôi hình quạt có viền màu trắng, trên trán có các lông mao dài màu trắng gặp nhau. Cổ họng và mặt nạ mắt có màu hơi đen và có viền ria mép màu trắng.', NULL, 'Loài đuôi quạt lông mày trắng sinh sản khắp các vùng nhiệt đới của Tiểu lục địa Ấn Độ và Đông Nam Á . Loài này phân bố từ miền đông Pakistan đến miền nam Đông Dương', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3814, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Monarchidae', 'Rẻ Quạt', 'FAM_246', 'Rhipidura', NULL, 'GEN_1734', 'rhipidurahypoxantha', 'Rhipidura hypoxantha', 'Blyth, 1843            ', 'Rẻ quạt bụng vàng', 'SPA_03846', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3815, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Monarchidae', 'Rẻ Quạt', 'FAM_246', 'Rhipidura', NULL, 'GEN_1734', 'rhipidurajavanica', 'Rhipidura javanica', '(Sparrman, 1788)', 'Rẻ quạt Java ', 'SPA_03847', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3816, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Monarchidae', 'Rẻ Quạt', 'FAM_246', 'Terpsiphone', NULL, 'GEN_1933', 'terpsiphoneatrocaudata', 'Terpsiphone atrocaudata', '(Eyton, 1839)', 'Thiên đường đuôi đen', 'SPA_03849', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3817, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Monarchidae', 'Rẻ Quạt', 'FAM_246', 'Terpsiphone', NULL, 'GEN_1933', 'terpsiphoneparadisi', 'Terpsiphone paradisi', '(Linnaeus, 1758)            ', 'Thiên đường đuôi phướn', 'SPA_03850', ' 21cm. Chim trống có đuôi dài tới 25cm, màu nâu hung đỏ tươi, đầu (có mào lông) màu xanh, mỏ và vành mắt màu xanh da trời. Có 2 dạng, dạng màu nâu thì có cánh và đuôi hung nâu, ngực xanh nhạt, dạng màu trắng, ngược lại, các phần đó chỉ có một màu. Chim mái: Gần tương tự chim đực nâu, nhưng mào ngắn hơn và lông đuôi ngắn. sống: Rừng thường xanh, rừng ngập mặn, cây bụi thứ sinh và vùng nương rẫy. Sống định cư, tuy nhiên có cả quần thể di cư. Gặp tương đối phổ biến lên đến độ cao khoảng 1.200 mét', NULL, 'Cả nước ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3818, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Motacillidae', 'Chìa Vôi', 'FAM_249', 'Anthus', NULL, 'GEN_0121', 'anthuscervinus', 'Anthus cervinus', '(Pallas, 1811).', 'Chim manh họng đỏ', 'SPA_03851', '16cm. Màu lông đầu của con đực vào mùa sinh sản có màu hung đỏ. Ngoài mùa sinh sản, bộ lông ở phần dưới cơ thể có nhiều sọc đen hơn so với Chim manh vân nam.  sống: Đồng ruộng, vùng cây trồng và nói chung chúng thích sống ở nơi ẩm ướt, gần nguồn nước. Phân bố lên tới độ cao khoảng 1.500 mét. Di cư đến nước ta vào mùa đông', NULL, ' Mùa đông gặp ở các vùng (trừ Tây Bắc). ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3819, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Motacillidae', 'Chìa Vôi', 'FAM_249', 'Anthus', NULL, 'GEN_0121', 'anthushodgsoni', 'Anthus hodgson', 'Richm.', 'Chim manh vân nam', 'SPA_03852', 'Màu nâu xanh có sọc nâu đậm hơn ở trên. Supercilium, thanh cánh kép và các đường thẳng bên ngoài màu trắng. Màu trắng nhạt, phía dưới có sọc nâu sẫm ở ngực và hai bên sườn. Giới tính như nhau.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3820, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Motacillidae', 'Chìa Vôi', 'FAM_249', 'Anthus', NULL, 'GEN_0121', 'anthusnovaeseelandae', 'Anthus novaeseelandae', '(Gmelin, 1789)', 'Chim manh lớn ', 'SPA_03853', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3821, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Motacillidae', 'Chìa Vôi', 'FAM_249', 'Anthus', NULL, 'GEN_0121', 'anthusrichardi', 'Anthus richardi', 'Vieillot, 1818            ', 'Chim manh lớn', 'SPA_03854', '18cm. Thường gặp ở tư thế đậu người, chân dài, cánh nhỏ ở lót tạo thành phạm vi. Chân chân sau có vuốt dài. Chim non có nhiều sợi lông trắng nhạt phủ lên lông bao cánh và lông tam cấp, kích có tuyết. sống: Cánh đồng lúa, bãi cỏ và khu vực trồng trọt trống trải. Sống định cư và làm tổ, có thể có quần thể cư trú trong mùa đông, phổ biến, thường đi lẻ.', NULL, 'Khắp các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3822, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Motacillidae', 'Chìa Vôi', 'FAM_249', 'Anthus', NULL, 'GEN_0121', 'anthusrubescens', 'Anthus rubescens', '(Tunstall, 1771)', 'Chim manh lưng xám', 'SPA_03855', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3823, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Motacillidae', 'Chìa Vôi', 'FAM_249', 'Anthus', NULL, 'GEN_0121', 'anthusrufulus', 'Anthus rufulus', '(Vieillot, 1818).', 'Chim manh', 'SPA_03856', 'Đây là một loài chim mỏ lớn có chiều cao 15 cm, nhưng mặt khác là một loài chim có vẻ ngoài không được phân biệt, chủ yếu có các vệt màu nâu xám ở trên và nhạt ở dưới với các vệt ở ngực. Nó có chân dài với cái đuôi dài và cái mỏ dài màu sẫm. Giới tính tương tự nhau. Bộ lông mùa hè và mùa đông giống nhau. Chim non có màu sắc bên dưới phong phú hơn chim trưởng thành và có các mép lông nhạt ở phần trên dễ thấy hơn với các đốm nổi bật hơn trên ngực. được tìm thấy trong môi trường sống mở, đặc biệt là đồng cỏ ngắn và trồng trọt trên đất trống. Nó chạy rất nhanh trên mặt đất và khi lao đi, nó không bay xa. Chim có thể có hai lứa trở lên trong một năm. Trong mùa sinh sản, nó hót bằng cách lặp lại một nốt nhạc khi hạ cánh sau một chuyến bay ngắn rung rinh, cách mặt đất vài mét. Nó xây tổ trên mặt đất dưới một chỗ nổi bật nhẹ, một chùm cỏ hoặc ở rìa một bụi cây. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Thainationalparks'),
(3824, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Motacillidae', 'Chìa Vôi', 'FAM_249', 'Dendronanthus', NULL, 'GEN_0562', 'dendronanthusindicus', 'Dendronanthus indicus', '(Gmelin, 1789). ', 'Chìa vôi rừng', 'SPA_03857', '18cm. Có các dải đen ở ngực và trắng nhạt rộng ở cánh. Cử động của cơ thể thường sang hai bên chứ không lên xuống như các loài chìa vôi khác.  Tìm thấy vào mùa đông,sống: Phần lớn gặp ở rừng cây gỗ và tre vầu, ít khi gặp ở vườn. Thường đậu ở cành cây.', NULL, ' Đông Bắc, Bắc và Nam của vùng Trung Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3825, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Motacillidae', 'Chìa Vôi', 'FAM_249', 'Motacilla', NULL, 'GEN_1256', 'motacillaalba', 'Motacilla alba', '(Linnaeus, 1758)            ', 'Chìa vôi trắng', 'SPA_03858', '19cm. Nhìn chung bộ lông có màu trắng và đen, lưng trên màu xám ở con cái. Về mùa đông, màu lông ít đen hơn và phía dưới cơ thể thường có màu xám. Chim non có phần trên cơ thể và một dải trước ngực hẹp màu nâu. sống: Đồng ruộng, ven đường, chỗ trống trải và nơi gần nguồn nước. Di cư đến vào mùa đông. Có thể có chủng quần làm tổ ở phía Bắc nước ta', NULL, 'Khắp các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3826, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Motacillidae', 'Chìa Vôi', 'FAM_249', 'Motacilla', NULL, 'GEN_1256', 'motacillacinerea', 'Motacilla cinerea', '(Tunstall, 1771)            ', 'Chìa vôi núi ', 'SPA_03859', ' 19cm. Phía trên lưng có màu xám, phần dưới có màu vàng nhạt, lông mày trắng. Vào mùa hè, con đực có họng màu đen. Chim non phần dưới cơ thể màu nhạt hơn, nhưng dưới đuôi luôn luôn vàng. Khác với Chìa vôi vàng bởi lông đuôi dài hơn và hông màu vàng-xanh lá cây; họng không vàng. Tiếng kêu: Tiếng kêu của nó có nhạc điệu hơn so với Chìa vôi trắng, thường nghe ‘stit-it’ hoặc ‘stit-it-it’, tuy nhiên khó phân biệt.', NULL, 'Rộng khắp các vùng trong cả nước.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3827, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Motacillidae', 'Chìa Vôi', 'FAM_249', 'Motacilla', NULL, 'GEN_1256', 'motacillaflava', 'Motacilla flava', 'Linnaeus, 1758', 'Chìa vôi vàng ', 'SPA_03860', '18cm. Chim trưởng thành: Nhìn chung phần dưới cơ thể có màu vàng (đôi khi lẫn màu trắng), giò màu đen và lông đuôi có viền trắng. Phía lưng có màu xanh ô liu. Cả chim đực và chim cái trong mùa đông đều có màu nhạt hơn. Bộ lông con non trong mùa đông đầu tiên có màu hơi nâu, thường nhìn rõ lông mày, phần dưới cơ thể màu hơi trắng, đôi khi vàng nhạt. Tiếng kêu: Không ồn ào so với Chìa vôi trắng và Chìa vôi núi. Thường kêu ‘ts-uip’ khi bị xua đuổi hoặc trong khi bay.', NULL, 'Từ vùng Đông Bắc đến Nam Bộ. M.f. taivana: Mùa đông gặp ở đồng bằng Bắc Bộ, Quảng Trị và Thừa Thiên Huế. M.f. simillina: Chỉ mới tìm thấy ở đảo Phú Quốc và M.f. macroyx: Về mùa đông đã tìm thấy ở đồng bằng Bắc Bộ, Quảng Trị, Thừa Thiên Huế, Quảng Nam và đảo Phú Quốc.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3828, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Motacillidae', 'Chìa Vôi', 'FAM_249', 'Motacilla', NULL, 'GEN_1256', 'motacillasamveasnae', 'Motacilla samveasnae', 'Duckworth, Alström, Davidson, Evans, Setha & Timmins, 2001', 'Chìa vôi mêkông', 'SPA_03861', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3829, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Anthipes', NULL, 'GEN_0116', 'anthipesmonileger', 'Anthipes monileger', '(Hodgson, 1845).', 'Đớp ruồi họng trắng', 'SPA_03862', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3830, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Calliope', NULL, 'GEN_0283', 'calliopecalliope', 'Calliope calliope', '(Pallas, 1776)', 'Oanh cổ đỏ', 'SPA_03863', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3831, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Chaimarrornis', NULL, 'GEN_0356', 'chaimarrornisleucocephalus', 'Chaimarrornis leucocephalus', '(Vigors, 1831)', 'Đuôi đỏ đầu trắng', 'SPA_03864', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3832, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Copsychus', NULL, 'GEN_0461', 'copsychusmalabaricus', 'Copsychus malabaricus', '(Scopoli, 1788)            ', 'Chích choè lửa', 'SPA_03865', 'Chim trống 28cm, chim cái 22cm. Chim trống: Đầu, họng, ngực trên và phần trên cơ thể màu đen; hông màu trắng; lông bao trên đuôi, các lông đuôi ngoài và phần dưới cơ thể màu nâu vàng tối. Chim mái: Giống như chim đực nhưng màu hơi xám; màu đen ở chim đực thay bằng màu xám ở chim cái; bụng và lông bao dưới đuôi nâu hung. Chim non: Giống như chim cái nhưng màu xám thay cho màu nâu; lông bao cánh và vai nâu đỏ nhạt.', NULL, 'Tất cả các vùng trong cả nước.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3833, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Copsychus', NULL, 'GEN_0461', 'copsychussaularis', 'Copsychus saularis', '(Linnaeus, 1758)            ', 'Chích Choè', 'SPA_03866', 'Lông bao cánh nhỏ và nhỡ, mép của các lông cánh thứ cấp ở giữa, bụng, dưới đuôi và 4 lông đuôi ngoài cùng trắng, đôi lông đuôi thứ tư có phần gốc trắng. Phần còn lại của bộ lông đen ánh xanh. Nách và dưới cánh đen có viền trắng khá rộng. Mắt nâu. Mỏ đen. Chân nâu thẫm hay xám thẫm. Cánh: 90 - 110; đuôi: 78 - 94; giò: 28 - 31; mỏ: 18 - 19mm. ', NULL, 'Phổ biến ở tất cả các vùng từ Bắc đến Nam Ấn Độ, Miến Điện, Thái Lan, Nam Trung Quốc và Đông Dương', NULL, NULL, 'Có giá trị khoa học và thẩm mỹ. Tiếng hót hay. Là đối tượng nghiên cứu khoa học và giúp cân bằng sinh thái trong tự nhiên', NULL, NULL, NULL, 'VnCreature'),
(3834, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Culicicapa', NULL, 'GEN_0504', 'culicicapaceylonensis', 'Culicicapa ceylonensis', '(Swainson, 1820)            ', 'Đớp ruồi Xây Lan', 'SPA_03867', '13cm. Đầu xám, lưng có màu xanh lá cây, hông, ngực dưới và bụng màu vàng. Thường bay lượn tìm mồi xung quanh chỗ đậu. sống: Các loại rừng và cây bụi thứ sinh. Sinh sản ở vùng đai cao nhưng mùa đông chuyển xuống đai thấp hơn. Sống định cư, tuy nhiên có cả quần thể di cư. Gặp tương đối phổ biến trong các khu phân bố lên đến độ cao khoảng 2.400 mét.', NULL, 'Khắp các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3835, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Cyanecula', NULL, 'GEN_0513', 'cyaneculasvecica', 'Cyanecula svecica', '(Linnaeus, 1758)', 'Oanh cổ xanh', 'SPA_03868', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3836, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Cyanoptila', NULL, 'GEN_0515', 'cyanoptilacyanomelana', 'Cyanoptila cyanomelana', '(Temminck, 1829). ', 'Đớp ruồi Nhật Bản', 'SPA_03869', ' 18cm. Chim trống: Loài phụ cyanomelana có nhiều màu: Xanh cô-ban, đen và trắng. Loài phụ cumatilis bạc màu hơn. Chim trống vào đầu mùa đông có đầu, lưng và ngực màu nâu; cánh và đuôi màu xanh da trời nhạt; họng trắng nhạt. Chim mái: Có vành mắt trắng khác biệt, giống con Đớp ruồi nâu lớn (nhưng vùng trước mắt không trắng nhạt), mép lông cánh không có màu trắng nhạt. sống: Rừng cây gỗ thưa và vườn cây. Có thể chỉ bay qua trên đường di cư đến phía Nam. Hiếm.', NULL, 'Tây Bắc và Trung Bộ. Đã tìm thấy trước đây ở Sa Pa và Quảng Trị. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3837, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Cyornis', NULL, 'GEN_0533', 'cyornisbanyumas', 'Cyornis banyumas', '(Horsfield, 1821)', 'Đớp ruồi họng hung', 'SPA_03870', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3838, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Cyornis', NULL, 'GEN_0533', 'cyornisconcretus', 'Cyornis concretan', '(Müller, S 1836)', 'Đớp ruồi trắng', 'SPA_03871', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3839, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Cyornis', NULL, 'GEN_0533', 'cyornishainanus', 'Cyornis hainana', '(Ogilvie-Grant, 1900)', 'Đớp ruồi hải nam', 'SPA_03872', '15cm. Chim trống: Nhìn chung cơ thể có màu xanh, trừ bụng trắng. Trán và vai màu xanh da trời sáng. Chim trống non có họng màu trắng. Chim mái: Phần trên thân màu nâu, đuôi màu hung nhạt. Họng và ngực màu hạt dẻ, bụng trắng. Chim non: Giống như chim cái nhưng có đốm ở đầu, ngực và cánh. sống: Tầng cây bụi và tre nứa dưới tán rừng cây gỗ thưa.  Loài sống định cư, gặp lên tới độ cao khoảng 1.000 mét. Tương đối phổ biến.', NULL, 'Cả nước trừ vùng Nam Trung Bộ. Trước đây đã thu mẫu ở Tây Bắc và Nghệ An. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3840, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Cyornis', NULL, 'GEN_0533', 'cyornisrubeculoides', 'Cyornis rubeculoides', '(Vigors, 1831)', 'Đớp ruồi cằm xanh', 'SPA_03873', '15cm. Chim trống : Màu xanh da trời và da cam; màu da cam. Chim mái : Phía sau màu nâu, đuôi màu hung, nhạt trắng nhạt, dải bồi mau da cam nhạt.', NULL, 'Đông Bắc và Trung Bộ. Đã tìm thấy ở Cúc Phương và một số nơi khác.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/group/blue-throated-flycatcher-332'),
(3841, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Cyornis', NULL, 'GEN_0533', 'cyornistickelliae', 'Cyornis tickelliae', 'Blyth, 1843', 'Đớp ruồi họng vàng', 'SPA_03874', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3842, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Cyornis', NULL, 'GEN_0533', 'cyornisunicolor', 'Cyornis unicolor', 'Blyth, 1843            ', 'Đớp ruồi xanh nhạt', 'SPA_03875', '18cm. Chim trống: Giống như Đớp ruồi xanh xám nhưng có phần trước đỉnh đầu màu xanh da trời sáng, mỏ dài hơn, bao dưới đuôi và bụng trắng xám nhạt. Chim mái: Phía lưng màu nâu, đuôi nâu đỏ, phần dưới thân gần giống ở con đực. sống: Rừng thường xanh. Loài định cư', NULL, 'Tây Bắc, Đông Bắc và Tây Nguyên. Gặp tới độ cao khoảng 1.800 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3843, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Eumyias', NULL, 'GEN_0688', 'eumyiasthalassina', 'Eumyias thalassina', '(Swainson, 1838)            ', 'Đớp ruồi xanh xám', 'SPA_03876', '17cm. Chim trống: Toàn thân có màu xanh da trời, vùng trước mắt đen. Chim mái: Màu xám xịt hơn, vùng trước mắt sẫm màu.', NULL, 'Ba Vì', NULL, NULL, NULL, NULL, NULL, NULL, 'Danh lục thú vườn quốc gia Ba Vì'),
(3844, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Ficedula', NULL, 'GEN_0715', 'ficedulaalbicilla', 'Ficedula albicilla', '(Bechstein , 1792)', 'Đớp ruồi họng đỏ', 'SPA_03877', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3845, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Ficedula', NULL, 'GEN_0715', 'ficeduladumetoria', 'Ficedula dumetoria', '(Wallace, AR 1864)', 'Đớp ruôi mặt hung', 'SPA_03878', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3846, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Ficedula', NULL, 'GEN_0715', 'ficedulahyperythra', 'Ficedula hyperythra', '(Blyth, 1843)            ', 'Đớp ruồi mày trắng', 'SPA_03879', '11cm. Nhỏ, đuôi ngắn. Chim trống: Đầu và lưng có màu xanh, họng hung, cánh nâu nhạt, mày trắng. Gốc đuôi màu trắng nhưng khó thấy. Chim mái: Không có màu xanh, có màu xám nâu và hung nhạt. sống: Tầng cây bụi dưới tán rừng thường xanh.  Sống định cư, gặp ở độ cao khoảng 1.000-2.600 mét, mùa đông chuyển xuống thấp hơn. Không phổ biến.', NULL, 'Tây Bắc và Nam Trung Bộ. Trước đây đã tìm thấy ở Sa Pa, Yên Bái, Bắc Kạn và Lâm Đồng. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3847, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Ficedula', NULL, 'GEN_0715', 'ficedulamonileger', 'Ficedula monileger', '(Hodgson, 1845)            ', 'Đớp ruồi họng trắng', 'SPA_03880', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3848, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Ficedula', NULL, 'GEN_0715', 'ficedulamugimaki', 'Ficedula mugimaki', '(Temminck, 1815)', 'Đớp ruồi Mugi', 'SPA_03881', ' 13cm. Cánh dài quá nửa chiều dài đuôi. Chim trống: Khó bị lẫn với các loài khác. Chim ttrống non nhìn chung có màu nhạt hơn, vằn cánh ít nổi bật hơn. Chim mái: Giống như chim đực non nhưng vằn cánh nhạt hơn và thậm chí màu da cam của phần dưới thân nhạt hơn. Lông chim có thời kì thay đổi (thậm chí mất cả màu da cam đặc trưng). sống: Rừng thường xanh, rừng thông và nương rẫy xung quanh buôn làng. Kiếm ăn gần mặt đất hoặc tán cao. Đi lẻ, thỉnh thoảng tập hợp thành đàn nhỏ. Loài di cư, có thể gặp chủ yếu từ trên 800 mét và lên đến độ cao khoảng 2.000 mét, không phổ biến.', NULL, 'Bắc Bộ và Tây Nguyên ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3849, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Ficedula', NULL, 'GEN_0715', 'ficedulanarcissina', 'Ficedula narcissina', '(Temminck, 1836)', 'Đớp ruồi mày vàng', 'SPA_03882', ' 13cm. Chim trống: Khác với Đớp ruồi vàng bởi lông mày vàng tươi và bụng trắng. Chim trống già có sườn màu da cam đậm hơn, chim đực non sườn có xám và xanh lá cây. Chim trống một năm tuổi giống chim cái. Chim mái: Không rõ rệt. Phía lưng màu ô-liu xám nhạt chuyển dần đến màu nâu ở đuôi. Phía bụng màu xám-nâu nhạt, họng và vành mắt trắng nhạt.  sống: Rừng thường xanh, cửa rừng và rừng trồng. Có thể gặp đến độ cao khoảng 1.300 mét. Loài bay qua, không phổ biến.', NULL, 'Đông Bắc và Trung Trung Bộ. Trước đây đã thu mẫu ở Bắc Bộ, Quảng Trị và Thừa Thiên. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3850, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Ficedula', NULL, 'GEN_0715', 'ficedulaparva', 'Ficedula parra', '(Bechstein, 1792)', 'Đớp ruồi họng đỏ', 'SPA_03883', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3851, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Ficedula', NULL, 'GEN_0715', 'ficedulastrophiata', 'Ficedula strophiata', '(Hodgson, 1837)            ', 'Đớp ruồi họng hung', 'SPA_03884', 'Nhìn chung giống Đớp ruồi họng đỏ nhưng toàn thân có màu tối hơn, trán trắng, họng hay vòng cổ màu hung vàng cam. Chim trống non ngực không có màu xám, chỉ có màu vàng cam nhạt và trắng. ', NULL, ' Bắc Bộ, Bắc và Nam Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3852, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Ficedula', NULL, 'GEN_0715', 'ficedulatricolor', 'Ficedula tricolor', '(Hodgson, 1845)            ', 'Đớp ruồi mặt đen', 'SPA_03885', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3853, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Ficedula', NULL, 'GEN_0715', 'ficedulawestermanni', 'Ficedula westermanni', '(Sharpe, 1888)            ', 'Đớp ruồi đen mày trắng', 'SPA_03886', '11cm. Chim trống: Nhỏ, màu đen và trắng, dễ phân biệt. Chim mái: Nhỏ, màu xám tro, phớt hung từ hông đến đuôi.', NULL, 'Tây Bắc, Bắc và Nam Trung Bộ. Trước đây đã thu mẫu ở Sa Pa và Kon Tum.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3854, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Ficedula', NULL, 'GEN_0715', 'ficedulazanthopygia', 'Ficedula zanthipygia', '(Hay, 1845)', 'Đớp ruồi vàng', 'SPA_03887', 'Chim trống: Phía lưng màu đen, lông mày trắng, có mảng trắng trên cánh, hông vàng. Phía bụng vàng, lông bao trên đuôi màu trắng. Chim trống non vào mùa thu tương tự như chim cái nhưng đuôi màu đen nhạt. Chim mái: Phía lưng màu xanh ô liu, vằn cánh trắng nhạt, hông màu vàng tươi. Phía bụng màu vàng, họng nhạt màu hơn. Khi đậu, chân thẳng đứng hơn so với chim chích, lông đỉnh đầu thường hơi dựng. ', NULL, 'Bắc Bộ và Trung Bộ (phía Nam đến Bắc đèo Hải Vân). Ghi nhận di cư đến Đồng bằng Sông Cử Long (Cà Mau 2006, Hậu Giang 2016). Mùa đông gặp lên tới độ cao khoảng 950 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3855, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Heteroxenicus', NULL, 'GEN_0878', 'heteroxenicusstellatus', 'Heteroxenicus stellatus', '(Gould, 1868).', 'Hoét đuôi cụt bụng vằn', 'SPA_03888', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3856, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Kittacincla', NULL, 'GEN_0999', 'kittacinclamalabarica', 'Kittacincla malabarica', '(Scopoli, 1786).', 'Chích choè lửa', 'SPA_03889', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3857, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Larvivora', NULL, 'GEN_1032', 'larvivoracyane', 'Larvivora cyane', '(Pallas, 1776). ', 'Oanh lưng xanh', 'SPA_03890', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3858, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Larvivora', NULL, 'GEN_1032', 'larvivorasibilans', 'Larvivora sibilans', '(Swinhoe, 1863).', 'Oanh cổ trắng', 'SPA_03891', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3859, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Muscicapa', NULL, 'GEN_1263', 'muscicapadauurica', 'Muscicapa daunica', 'Pallas, 1811.', 'Đớp ruồi nâu', 'SPA_03892', '13cm. Màu nâu xám nhạt, đơn điệu; phía bụng không có sọc và thường phủ màu xám-nâu nhạt. Chim ở mùa đông đầu tiên có vằn cánh và viền mép lông cánh màu trắng. Vành mắt trắng nhạt. Gốc mỏ dưới màu vàng nhạt. Khi đậu yên, mút cánh nằm ở điểm giữa của đường thẳng tới đuôi. Tiếng kêu: Có tiếng hót nhẹ nhàng, ngắn, êm dịu.', NULL, 'Khắp các vùng trong cả nước.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3860, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Muscicapa', NULL, 'GEN_1263', 'muscicapaferruginea', 'Muscicapa ferruginea', '(Hodgson, 1845)            ', 'Đớp ruồi đuôi hung', 'SPA_03893', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3861, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Muscicapa', NULL, 'GEN_1263', 'muscicapagriseisticta', 'Muscicapa griseisticta', '(Swinhoe, R 1861).', 'Đớp ruồi xám', 'SPA_03894', 'Nó là một loài chim mảnh khảnh, có cánh dài, dài từ 13 đến 15 cm. Nó chủ yếu có màu nâu xám ở trên và màu trắng ở dưới. Ngực và hai bên sườn có nhiều vệt màu xám. Có một vạch trắng hẹp trên cánh và một mảng nhạt giữa mỏ và mắt. Mỏ và bàn chân có màu đen. Mắt to và có vành mắt màu trắng. Con đực và con cái trưởng thành giống nhau nhưng chim non khác nhau ở chỗ có đốm trắng và vảy sẫm màu ở phần trên. Nó đậu ngoài trời, chờ côn trùng đi ngang qua, sau đó bay xa tới 20 mét để bắt chúng trước khi quay trở lại chỗ đậu và ăn thịt chúng.', NULL, ' Nó sinh sản trong các khu rừng lá kim rộng lớn ở phía đông bắc Trung Quốc, Bắc Triều Tiên và đông nam Siberia bao gồm Sakhalin và Kamchatka. Vào mùa xuân và mùa thu, nó di cư qua miền đông và miền nam Trung Quốc, Hàn Quốc, Nhật Bản và Đài Loan. Vào mùa đông, nó xuất hiện ở các khu rừng, bìa rừng và vùng đất trống có cây mọc rải rác ở Borneo, Philippines, Palau, miền đông Indonesia và New Guinea. Nó là loài lang thang đến Singapore, Việt Nam, Alaska và Australia.', NULL, NULL, NULL, NULL, NULL, NULL, 'Jungledragon'),
(3862, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Muscicapa', NULL, 'GEN_1263', 'muscicapalatirostris', 'Muscicapa latirostris', '(Raffles, 1822)', 'Đớp ruồi mỏ hẹp', 'SPA_03895', 'Loài này dài 13 cm, bao gồm cả đuôi vểnh. Nó có hình dạng tương tự như loài đớp ruồi đốm lớn hơn nhưng có đuôi tương đối dài hơn. Hóa đơn tối tương đối lớn và có phạm vi rộng.\nCon trưởng thành có phần trên màu nâu xám, trở nên xám hơn khi bộ lông già đi và phần dưới màu trắng với hai bên sườn có màu nâu. Chim non có vảy màu nâu ở phần trên, đầu và ức. tìm thấy ở vùng rừng thưa và vùng trồng trọt. Nó làm tổ trong một cái lỗ trên cây, đẻ bốn quả trứng do con cái ấp. Đây là loài ăn côn trùng sinh sản ở Nhật Bản, miền đông Siberia và dãy Himalaya. Nó di cư và trú đông ở vùng nhiệt đới Nam Á từ miền nam Ấn Độ và Sri Lanka về phía đông đến Indonesia.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Thainationalparks'),
(3863, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Muscicapa', NULL, 'GEN_1263', 'muscicapamuttui', 'Muscicapa muttui', '(E.L.Layard, 1854)', 'Đớp ruồi ngực nâu', 'SPA_03896', 'Mô tả: 13cm. Rất giống Đớp nâu nhưng hông và đuôi nâu hơn; viền lông cánh màu nâu; giò có màu nhạt hơn. Khác với Đòn tấn công bằng họa tiết trên mặt tương phản, trong đó có vạch dưới gốc và vạch gò má.', NULL, 'Phân vùng: Tây Bắc.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/vietnamese-name/brown-breasted-flycatcher-1014'),
(3864, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Muscicapa', NULL, 'GEN_1263', 'muscicapaparva', 'Muscicapa parva', 'Bechstein, 1794', 'Đớp ruồi bụng vàng', 'SPA_03897', 'Con đực sinh sản của loài đớp ruồi nhỏ dài 11–12 cm này chủ yếu có màu nâu ở trên và màu trắng ở dưới, đầu màu xám và cổ họng màu cam. Mỏ màu đen và có hình dạng rộng nhưng nhọn đặc trưng của loài ăn côn trùng trên không. Ngoài việc bắt côn trùng khi đang bay, loài này còn săn sâu bướm giữa những tán lá sồi và sẽ ăn quả mọng. Phần gốc của lông đuôi ngoài có màu trắng và đuôi thường vểnh lên trên khi chúng đậu để tìm kiếm con mồi côn trùng bị bắt trên cánh hoặc đôi khi từ mặt đất. Vào mùa đông, chúng hầu như im lặng nhưng có tiếng kêu đớp ruồi chip-chip-chr-rrr điển hình . Vào mùa sinh sản của chúng, bài hát bao gồm những tiếng huýt sáo du dương, giống như tiếng chim đớp ruồi châu Âu .', NULL, 'Nó sinh sản ở Đông Âu và khắp Trung Á và di cư , trú đông ở Nam Á. Nó là loài di cư thường xuyên ở Tây Âu, trong khi loài đớp ruồi có cổ sinh sản ở phía đông lại rất hiếm.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Red-breasted_flycatcher'),
(3865, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Muscicapa', NULL, 'GEN_1263', 'muscicapasibirica', 'Muscicapa siberica', 'Gmelin, JF, 1789.', 'Đớp ruồi Siberi', 'SPA_03898', '13cm. Nhìn chung bộ lông có màu rất xám. Dễ lẫn với chim đớp ruồi xám. Khi đậu yên thì mút cánh nằm ở 2/3 chiều dài tới đuôi. Thường đậu lộ liễu ở vùng rừng thưa. Vào mùa xuân mặt bụng có màu xám sẫm (trông giống như một đường nét bút lông lớn), họng trắng, tạo nên nửa vòng cổ phía trước; vùng giữa ngực và bụng màu trắng. Bộ lông mùa đông đầu tiên nhiều màu, ở một số con chỉ có màu xám tàn thuốc ở ngực và sườn, số khác có nhiều sọc. Vành mắt trắng không đồng đều, đường viền lông tam cấp và vằn cánh có màu vàng phớt nâu. sống: Các vùng rừng và tại những nơi trống trải.  Loài di cư', NULL, 'Cả nước (riêng ở Bắc Trung Bộ chưa có số liệu). ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3866, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Muscicapa', NULL, 'GEN_1263', 'muscicapathalassina', 'Muscicapa thalassina', 'Swainson, 1838.', 'Đớp ruồi xanh xám', 'SPA_03899', '17cm. Chim trống: Toàn thân có màu xanh da trời, vùng trước mắt đen. Chim mái: Màu xám xịt hơn, vùng trước mắt sẫm màu.', NULL, 'Khắp các vùng trong cả nước.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3867, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Myiomela', NULL, 'GEN_1269', 'myiomelaleucura', 'Myiomela leucura', '(Hodgson, 1845)            ', 'Oanh đuôi trắng', 'SPA_03900', 'Chim trống: Dễ nhận dạng. Màu xanh đen, hai dải trắng dọc trên đuôi. Chim mái: Nhìn chung có màu nâu xám, một dải ở họng và bụng trắng. Trên đuôi có hai dải trắng tương tự chim đực. sống: Kiếm ăn dưới tán rừng, gặp ở độ cao khoảng 1.500-2.000 mét. Thường kiếm ăn gần mặt đất.', NULL, 'Từ khoảng đèo Hải Vân đến hết Lâm Đồng. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3868, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Myophonus', NULL, 'GEN_1273', 'myophonuscaeruleus', 'Myophonus caeruleus', '(Scopoli, 1786)', 'Hoét xanh', 'SPA_03901', '33cm. Khi ánh sáng tốt, có thể nhìn rõ lông màu tím sẫm và nhiều đốm lấp lánh ánh thép, nhưng trong bóng dâm chỉ thấy màu đen. Chim non màu đen xỉn. Đuôi luôn xoè hình quạt. Hoạt động vào lúc hoàng hôn hoặc bình minh.  Các vùng rừng, ở ven bờ suối và vách núi đá. Tuy nhiên gặp kiếm ăn ở nơi thoáng đãng và hay xuất hiện ở các vùng cây. Có các quần thể di cư và định cư, nhưng không gặp các loài di cư ở Nam Bộ. Không phổ biến.', NULL, 'Khắp các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Birdwatchingvietnam'),
(3869, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Niltava', NULL, 'GEN_1324', 'niltavabanyumas', 'Niltava banyumas', '(Horsfield, T 1821)', 'Đớp ruồi xám họng hung', 'SPA_03902', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3870, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Niltava', NULL, 'GEN_1324', 'niltavaconcreta', 'Niltava concreta', '(Sharpe, 1890)', 'Đớp ruồi trắng', 'SPA_03903', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3871, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Niltava', NULL, 'GEN_1324', 'niltavadavidi', 'Niltava davida', 'Hodgson, 1837', 'Đớp ruồi cằm đen', 'SPA_03904', '18cm. Đớp ruồi xanh lớn. Chim trống: Phía lưng màu xanh da trời sáng và có nhiều mảng óng ánh. Họng đen và phía bụng màu da cam. Chim mái: Phía lưng màu nâu nhạt, đuôi nâu đỏ. Đặc điểm nổi bật là có hình lưỡi liềm ngang họng và mảng xanh da trời trên vai (đôi khi không có).  sống: Tầng cây bụi dưới tán rừng. Sinh sản trên vùng núi nhưng mùa đông chuyển xuống đai thấp. Gặp ở vùng Đông Bắc, Bắc và Trung Trung Bộ vào mùa đông, có khả năng làm tổ ở vùng Tây Bắc. Gặp ở độ cao lên tới khoảng 1.700 mét.', NULL, 'Gặp ở vùng Đông Bắc, Bắc và Trung Trung Bộ vào mùa đông, có khả năng làm tổ ở vùng Tây Bắc. Gặp ở độ cao lên tới khoảng 1.700 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3872, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Niltava', NULL, 'GEN_1324', 'niltavagrandis', 'Niltava grandis', '(Blyth , 1842)', 'Đớp ruồi lớn', 'SPA_03905', 'Chim đực trưởng thành: Đỉnh đầu, hông, trên đuôi, lông bao cánh nhỏ và nhỡ và vệt ở bên cổ xanh biếc tươi. Lưng và vai xanh tím thẫm. Đuôi đen, các lông đuôi giữa và mép của các lông đuôi ngoài xanh tím hơi tươi hơn ở lưng. Lông bao cánh lớn và lông cánh đen viền xanh như ở lưng. Trước mắt, trán, hai bên đầu, cằm, họng và ngực trên đen chuyển thành đen xanh nhạt ở bụng và dưới đuôi.\nChim cái:Trước mắt, trán, vòng quanh mắt, tai và má nâu hung vàng với thân lông màu nhạt. Đỉnh đầu và gáy nâu vàng lục, hơi phớt xanh xám ở phía sau. Lưng, hông và trên đuôi nâu hung vàng. Lông cánh và lông đuôi nâu, đôi ông đuôi giữa hung, mép các lông đuôi hai bên và lông cánh cũng viền hung. Hai bên cổ có vệt xanh tươi. Giữa cằm, họng và ngực trên hung vàng nhạt. Phần còn lại của mặt bụng nâu vàng lục với gốc các lông xám. Nách và dưới cánh hung vàng.\nMắt nâu. Mỏ và chân đen (đực) hay nâu (cái).\nKích thước: Cánh: 99 - l13; đuôi: 65 - 70; giò: 23 - 24; mỏ: 15mm ', NULL, 'Việt Nam đã bắt được các vật mẫu ở Sapa, Lào Cai, Yên Bái và Thanh Hoá. Phân loài đớp ruồi lớn này phân bố ở Nêpan, Bắc Ấn Độ, Miến Điện, Thái Lan, Tây Nam Trung Quốc (Vân Nam) và Bắc Đông Dương.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3873, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Niltava', NULL, 'GEN_1324', 'niltavamacgrigoriae', 'Niltava macgrigoriae', '(Burton, 1836)            ', 'Đớp ruồi trán đen', 'SPA_03906', '14cm. Chim trống: Giống như Đớp ruồi hải nam nhưng nhỏ hơn và có mặt màu đen, dưới ngực và bụng trắng xám. Chim mái: Nhìn chung có màu nâu, cánh và đuôi nâu hung. Có mảng màu xanh da trời nhạt ở hai bên cổ. Tiếng kêu: Tiếng hót cao, líu lo ‘thri blaind maix’. Tiếng gọi đàn lanh lảnh giọng kim, ríu rít.', NULL, 'Bắc Bộ và Bắc Trung Bộ. Trước đây đã thu vật mẫu ở nhiều nơi.', NULL, NULL, NULL, NULL, 'LC', NULL, 'birdwatchingvietnam.net'),
(3874, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Niltava', NULL, 'GEN_1324', 'niltavasundra', 'Niltava sundra', 'Hodgson, 1837', 'Đớp ruồi ngực hung', 'SPA_03907', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3875, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Niltava', NULL, 'GEN_1324', 'niltavavivida', 'Niltava vivida', '(Swinhoe, 1864)', 'Đớp ruồi họng hung', 'SPA_03908', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3876, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Rhyacornis', NULL, 'GEN_1744', 'rhyacornisfuliginosus', 'Rhyacornis fuliginosa', '(Vigors, 1831)', 'Đuôi đỏ đầu xám', 'SPA_03909', '14cm. Đậu trên các mỏm đá trong lòng suối, đuôi vẫy liên hồi. Chim trống: Dễ nhận ra do bộ lông pha màu xanh tối và màu hung nâu đậm. Chim mái và chim non: Đuôi màu đen và trắng nổi bật. Chim non sắp trưởng thành: Như chim cái, song màu nâu đậm hơn và có nhiều đốm hung nâu. Hiếm khi sống xa nơi nguồn nước chảy. Gặp đi đơn lẻ hoặc đôi. Sinh sản ở đai cao dọc suối, và di chuyển xuống thấp vào mùa đông. Dọc theo khu vực suối đá ở rừng, nơi có độ cao khoảng 600 mét trở lên.', NULL, 'Tây Bắc, Tây Nguyên. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.'),
(3877, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Saxicola', NULL, 'GEN_1782', 'saxicolacaprata', 'Saxicola caprata', '(Linnaeus, 1766)            ', 'Sẻ bụi đen', 'SPA_03910', ' 14cm. Chim trống có màu dễ nhận dạng, giống Sẻ bụi đầu đen, nhìn chung toàn thân có màu đen, trừ hông và bao dưới đuôi màu trắng, và ở cánh có đốm trắng. Chim mái và chim non  màu sẫm hơn Sẻ bụi đầu đen (nhất là phần dưới cơ thể), hông và bao trên đuôi màu hung nâu. Các vùng cây bụi thứ sinh ở ven rừng, vùng nương rẫy và đồng cỏ trống trải. Sống định cư, gặp đến độ cao khoảng 1.500 mét. Không phổ biến.', NULL, 'Nam Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3878, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Saxicola', NULL, 'GEN_1782', 'saxicolaferrea', 'Saxicola ferrea', '(Hartert).', 'Sẻ bụi xám', 'SPA_03911', 'Chim đực trưởng thành: Bộ lông mùa Đông: trước mắt, má, tai và hai bên đầu đen. Dải lông mày xám nhạt. Lông mặt lưng đen, mép lông viền xám, mép lưng thường có vệt hung. Lông bao cánh trong cùng trắng. Cằm và họng trắng. Phần còn lại của mặt bụng xám nhạt, ngực hơi phớt hung. Bộ lông mùa hè: mép xám của các lông mòn dần đến Mùa hè mặt lưng hầu như đen hoàn toàn, còn mặt bụng lại trắng. Chim cái: Mặt lưng nâu nhạt, giữa các lông có vệt nâu thẫm, trên đuôi hung nâu. Mặt bụng hung nâu nhạt, cằm và họng trắng nhạt. Mắt nâu thẫm. Mỏ và chân đen. Kích thước: Cánh: 60 - 72; đuôi: 55 - 60; giò: 20 - 21; mỏ: 10 - 11mm ', NULL, 'Việt Nam thường gặp ở vùng đồi núi có nhiều cây bụi từ biên giới Việt - Trung đến Di Linh. Sẻ bụi xám phân bố ở Bắc Miến Điện, Nam Trung Quốc và Đông Dương.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3879, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Saxicola', NULL, 'GEN_1782', 'saxicolamaurus', 'Saxicola maurus', '(Pallas , 1773)', 'Sẻ bụi đầu đen', 'SPA_03912', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3880, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Saxicola', NULL, 'GEN_1782', 'saxicolastejnegeri', 'Saxicola stejnegeri', '(Parrot, 1908)', 'Sẻ bụi đầu đen', 'SPA_03913', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3881, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Muscicapidae', 'Đớp Ruồi', 'FAM_252', 'Saxicola', NULL, 'GEN_1782', 'saxicolatorquata', 'Saxicola torquata', '(Pallas, 1773)', 'Sẻ bụi đầu đen', 'SPA_03914', '14cm. Chim trống có nhiều điểm khác biệt dễ nhận. Đầu màu đen, có đốm trắng ở cổ, cánh và bao trên đuôi; ngực màu hung nhạt. Vào mùa thu, màu đen đổi thành hung nâu sẫm. Chim mái và chim non: Đầu màu nâu, lông mày xanh nhạt; phía lưng nâu và có sọc; phía bụng nâu sẫm; đuôi đen nhạt. Hầu hết khi bay để lộ ra các đốm trắng trên cánh.  Các vùng trồng trọt và đồng cỏ trống trải.  Loài di cư. Gặp phổ biến. Thường  đi lẻ hay đôi.', NULL, ' Các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3882, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Aethopyga', NULL, 'GEN_0045', 'aethopygachristinae', 'Aethopyga christinae', 'Swinhoe, 1869. ', 'Hút mật đuôi nhọn', 'SPA_03915', '9cm (không kể đuôi chim trống). Chim trống: Đầu xanh da trời sáng bóng, họng, vùng tai và ngực trên đỏ thẫm. Chim mái và chim non: Phía lưng xanh lục nhạt hơn ở con trống, chuyển màu xám ở đỉnh đầu, mặt bụng phớt vàng. sống: Rừng và cây bụi thứ sinh, và còn gặp ở vườn. Sống định cư, gặp tương đối phổ biến.', NULL, 'Từ vùng Đông Bắc đến hết Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3883, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Aethopyga', NULL, 'GEN_0045', 'aethopygagouldiae', 'Aethopyga gouldiae', '(Vigors, NA 1831)', 'Hút mât họng vàng', 'SPA_03916', '11-16cm.  Đỏ & Vàng. \nCon đực:  Đỉnh/cổ họng màu xanh, ngực/trên ngực màu đỏ, mông/bụng màu vàng\nCon cái:  Mặt dưới màu vàng, mặt trên màu xanh lục, đầu màu xám \nCon non:  Giống con cái', NULL, 'Phân loài  annmensis  phổ biến ở Nam An Nam (cao nguyên Đà Lạt); dabryii  tìm thấy ở Tây Nguyên, tỉnh Kon Tum và Bắc Kỳ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3884, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Aethopyga', NULL, 'GEN_0045', 'aethopyganipalensis', 'Aethopyga nipalensis', '(Hodgson, 1837)', 'Hút mât Nêpan', 'SPA_03917', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3885, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Aethopyga', NULL, 'GEN_0045', 'aethopygasaturata', 'Aethopyga saturata', '(Hodgson, 1836)', 'Hút mật ngực đỏ', 'SPA_03918', '11cm (không kể đuôi chim trống). Chim trống dễ phân biệt nhưng nếu ánh sáng mờ có thể chỉ thấy đầu cùng phần trên thân đen nhạt và mặt bụng màu kem. Chim mái gần giống chim mái của Hút mật họng vàng.', NULL, 'Tây Bắc và từ Nam đèo Hải Vân đến hết Nam Trung Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3886, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Aethopyga', NULL, 'GEN_0045', 'aethopygasiparaja', 'Aethopyga siparaja', '(Raffles, 1822)', 'Hút mật đỏ', 'SPA_03919', 'Hút mật đỏ là một loài chim có kích thức khá nhỏ - chiều dài cơ thể chúng chỉ chừng 11 cm. Chúng có chiếc mỏ cong với chiều dài trung bình, và đầu lưỡi có hình dáng như chiếc bút lông; cấu trúc mỏ và lưỡi như thế tỏ ra hiệu quả trong việc hút mật hoa. Con trống có ngực màu đỏ thẫm, lưng nâu sậm, phần lông ở phao câu màu vàng và bụng thì màu xanh ôliu. Con mái có lưng màu xanh lục như quả ôliu, ngực vàng và chỏm đuôi phía ngoài màu trắng. Phần lớn các con trống có đuôi màu lục-lam', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3887, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Anthreptes', NULL, 'GEN_0119', 'anthreptesmalacensis', 'Anthreptes malacensis', '(Scopoli, 1786).', 'Hút mật họng nâu', 'SPA_03920', 'Chim hút mật họng nâu là loài chim hút mật tương đối lớn và nặng, với mỏ khá dày. Chiều dài khoảng 14 cm, khối lượng 7,4–13,5 g (0,26–0,48 oz), con đực nói chung lớn hơn con cái một chút.\n\nCũng như các loài hút mật khác, chim trống có bộ lông sặc sỡ hơn chim mái. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'vi.wikipedia.org'),
(3888, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Anthreptes', NULL, 'GEN_0119', 'anthreptessingalensis', 'Anthreptes singalensis', '(Gmelin, 1788)', 'Hút mật bụng hung', 'SPA_03921', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3889, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Arachnothera', NULL, 'GEN_0141', 'arachnotherahypogrammica', 'Arachnothera hypogrammica', '(Müller, 1843)', 'Hút mật bụng vạch', 'SPA_03922', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3890, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Arachnothera', NULL, 'GEN_0141', 'arachnotheralongirostra', 'Arachnothera longirostra', '(Latham, 1790)', 'Bắp chuối mỏ dài', 'SPA_03923', 'Bắp chuối mỏ dài có kính thước trung bình lớn trong họ hút mật (khoảng 14 cm). Không giống như các loài hút mật khác, chim trống và mái rất giống nhau. Chúng nổi bật với mỏ dài cong xuống, đầu xám với vành mắt không tròn. Chúng đều có thân trên xanh olive và thân dưới màu vàng nhạt. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnamwildlife'),
(3891, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Arachnothera', NULL, 'GEN_0141', 'arachnotheramagna', 'Arachnothera magna', '(Hodgson, 1837)            ', 'Bắp chuối đốm đen', 'SPA_03924', 'Nó có kích thước tương tự như một con chim sẻ .Nó có màu vàng ô liu, với nhiều vệt sẫm màu hơn. Nó có mỏ dài, cong màu đen và chân màu vàng. Phía dưới có màu vàng nhạt có sọc đen. Mỏ của nó được điều chỉnh đặc biệt cho chế độ ăn mật hoa', NULL, 'Nó được tìm thấy ở Bangladesh, Bhutan, Campuchia, Trung Quốc, Ấn Độ, Lào, Malaysia, Myanma, Nepal, Thái Lan và Việt Nam. Ở Ấn Độ, nó được tìm thấy ở các bang miền Đông Ấn Độ .', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3892, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Chalcoparia', NULL, 'GEN_0358', 'chalcopariasingalensis', 'Chalcoparia singalensis', '(Gmelin, 1789)            ', 'Hút mật bụng hung', 'SPA_03925', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3893, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Cinnyris', NULL, 'GEN_0413', 'cinnyrisasiaticus', 'Cinnyris asiaticus', 'Latham , 1790', 'Hút mật họng đen', 'SPA_03926', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3894, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Cinnyris', NULL, 'GEN_0413', 'cinnyrisjugularis', 'Cinnyris jugularis', '(Linnaeus, 1758)            ', 'Hút mật họng tím', 'SPA_03927', ' 11cm. Chim trống: Họng và trên ngực màu xanh ánh kim loại. Bụng và bao dưới đuôi vàng sáng. Chim mái: Ngực, bụng và bao trên đuôi vàng. Mút lông đuôi chim trống và mái trắng.', NULL, 'Nam Trung Bộ, Tây Nguyên.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3895, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Hypogramma', NULL, 'GEN_0930', 'hypogrammahypogrammicum', 'Hypogramma hypogrammicum', '(Muller, 1843)            ', 'Hút mật bụng vạch', 'SPA_03928', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3896, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Leptocoma', NULL, 'GEN_1055', 'leptocomabrasiliana', 'Leptocoma brasiliana', '(Gmelin, 1788).', 'Hút mật họng hồng', 'SPA_03929', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3897, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Leptocoma', NULL, 'GEN_1055', 'leptocomasperata', 'Leptocoma sperata', '(Linnaeus, 1766).', 'Hút mật họng hồng ', 'SPA_03930', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3898, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Nectarinia', NULL, 'GEN_1292', 'nectariniaasiatica', 'Nectarinia asiatica', 'Latham, 1790            ', 'Hút mật họng đen', 'SPA_03931', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3899, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Nectarinia', NULL, 'GEN_1292', 'nectariniacalcostetha', 'Nectarinia calcostetha', '(Jardine, 1842)', 'Hút mật lưng đen', 'SPA_03932', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3900, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Nectarinia', NULL, 'GEN_1292', 'nectariniahypogrammica', 'Nectarinia hypogrammica', '(Müller, S 1843)', 'Hút mật bụng vạch', 'SPA_03933', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3901, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Nectarinia', NULL, 'GEN_1292', 'nectariniajugularis', 'Nectarinia jugularis', '(Linnaeus, 1766).', 'Hút mật họng tím', 'SPA_03934', 'Chim đực trưởng thành: Lông mặt lưng và mép các lông cánh lục vàng, trên đuôi hơi vàng hơn. Lông cánh nâu. Lông đuôi đen nhạt với mút trắng. Cằm và họng tím có ánh thép viền xanh ở hai bên họng và viền đỏ đồng và đen ở mép dưới. Mặt bụng vàng tươi. Hai bên ngực có túm lông vàng cam. Dưới cánh và. Chim cái: Mặt lưng nâu phớt vàng lục, mặt bụng vàng hơi phớt xám lục. Mắt nâu. Mỏ và chân đen. Kích thước: Cánh: 45 - 55; đuôi: 32 - 34; giò: 14 - 15; mỏ: 15 - 17mm. ', NULL, 'Ở Việt Nam đã bắt được các vật mẫu ở Phú Khánh, Bình Thuận, Kontum, Di Linh và Tây Ninh, Đồng Nai cho đến Cà Mau. Phân loài hút mật họng tím này phân bố ở Miến Điện, Thái Lan, Nam Lào, Camphuchia và Nam Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3902, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Nectariniidae', 'Hút Mật', 'FAM_257', 'Nectarinia', NULL, 'GEN_1292', 'nectariniasperata', 'Nectarinia sperata', '(Linnaeus, 1766)', 'Hút mật họng hồng', 'SPA_03935', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3903, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Oriolidae', 'Vàng Anh', 'FAM_264', 'Oriolus', NULL, 'GEN_1398', 'orioluschinensis', 'Oriolus chinensis', 'Linnaeus, 1766            ', 'Vàng anh Trung Quốc', 'SPA_03936', ' 27cm. Nhìn chung có màu vàng. Một dải lông màu đen kéo dài từ mắt vòng quanh gáy. Mỏ hồng thịt, chân xám xanh, cánh và trên đuôi đen. Bộ lông chim mái vàng lục, có nhiều vằn đen mảnh.   sống: Vùng cây bụi thứ sinh, nương rẫy, rừng ngập mặn, cây bụi ven bờ biển và các vùng rừng khác. Khá phổ biến. Các quần thể sống định cư có thể gặp tới độ cao khoảng 1.500 mét.', NULL, 'Bắc Bộ tới Nam Bộ ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3904, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Oriolidae', 'Vàng Anh', 'FAM_264', 'Oriolus', NULL, 'GEN_1398', 'oriolustenuirostris', 'Oriolus tenuirostris', 'Blyth , 1846', 'Vàng anh mỏ cong', 'SPA_03937', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3905, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Oriolidae', 'Vàng Anh', 'FAM_264', 'Oriolus', NULL, 'GEN_1398', 'oriolustraillii', 'Oriolus trailii', NULL, 'Tử anh', 'SPA_03938', 'Tử anh có kích thước tương tự các loài khác trong nhóm Vàng anh (khoảng 27 cm). Chim trống có đầu và ngực trên màu đen với mắt trắng, thân màu nâu đậm, đuôi màu nâu nhạt hơn, cánh đen. Chim mái toàn thân nhạt màu hơn chim trống, bụng trắng đục với nhiều sọc đậm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3906, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Oriolidae', 'Vàng Anh', 'FAM_264', 'Oriolus', NULL, 'GEN_1398', 'oriolusxanthornus', 'Oriolus xanthornus', '(Linnaeus, 1758).', 'Vàng anh đầu đen nhỏ', 'SPA_03939', 'Lông của chim nổi bật với hai màu đen và vàng đặc điểm đặc trưng của họ vàng anh. Chim có đầu đen, mỏ đỏ, mắt đỏ, đuôi và vai cánh điểm màu đen. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnamwildlife'),
(3907, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Paridae', 'Bạc Má', 'FAM_274', 'Melanochlora', NULL, 'GEN_1194', 'melanochlorasultanea', 'Melanochlora sultanea', '(Hodgson, 1837)            ', 'Chim mào vàng', 'SPA_03940', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3908, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Paridae', 'Bạc Má', 'FAM_274', 'Menalochlora', NULL, 'GEN_1203', 'menalochlorasultanea', 'Menalochlora sultanea', '(Hodgson, 1837).', 'Chim mào vàng', 'SPA_03941', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3909, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Paridae', 'Bạc Má', 'FAM_274', 'Parus', NULL, 'GEN_1481', 'paruscinereus', 'Parus cinereus', 'Vieillot, 1818', 'Bạc má xám', 'SPA_03942', 'lưng màu xám, mũ trùm đầu màu đen, mảng má màu trắng và sọc cánh màu trắng. Phần dưới có màu trắng với sọc đen ở giữa chạy dọc theo chiều dài. Con cái có đường bụng hẹp hơn và hơi xỉn màu hơn. Các tấm che đuôi phía trên có màu tro trong khi đuôi có màu đen với 4 cặp lông ở giữa có màu tro ở màng ngoài và tất cả ngoại trừ cặp lông ở giữa đều có chóp màu trắng. Cặp thứ năm có màu trắng với các trục màu đen và một dải màu đen ở màng bên trong. Cặp lông đuôi ngoài cùng đều có màu trắng với trục màu đen. Các tấm phủ dưới đuôi có màu đen ở giữa nhưng màu trắng ở hai bên. thường được nhìn thấy theo cặp hoặc nhóm nhỏ, đôi khi tham gia vào đàn kiếm ăn hỗn hợp các loài. Chúng kiếm ăn chủ yếu bằng cách mót, bắt côn trùng (chủ yếu là sâu bướm, bọ xít và bọ cánh cứng) bị quấy rầy và cũng sẽ ăn chồi và quả. Đôi khi chúng dùng chân để giữ côn trùng rồi dùng mỏ xé xác chúng. Chúng cũng có thể nhét những hạt cứng vào kẽ hở trên vỏ cây trước khi dùng mỏ đập vào chúng. Khoảng 4 đến 6 quả trứng tạo thành tổ bình thường, Mùa sinh sản là mùa hè và ngày tháng khác nhau tùy theo phạm vi của chúng. Một số loài chim có thể nuôi nhiều con. Ở miền nam Ấn Độ và Sri Lanka, mùa sinh sản là từ tháng 2 đến tháng 5 (chủ yếu trước gió mùa) nhưng người ta cũng thấy tổ từ tháng 9 đến tháng 11. Tổ được đặt trong các hốc trên cây hoặc trên tường hoặc bãi bùn có lỗ vào hẹp và sàn hang được lót bằng rêu, tóc và lông vũ. Đôi khi chúng tận dụng tổ cũ của chim gõ kiến ​​hoặc chim sẻ. Cả bố và mẹ đều tham gia ấp trứng và kêu rít từ trong tổ khi bị đe dọa. Chúng cũng có thể đậu trong các hốc như tre đã chặt.', NULL, ' kéo dài từ các vùng của Tây Á qua Nam Á và vào Đông Nam Á.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3910, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Paridae', 'Bạc Má', 'FAM_274', 'Parus', NULL, 'GEN_1481', 'parusmajor', 'Parus major', '(Linnaeus, 1758)            ', 'Bạc má', 'SPA_03943', '13cm. Kích thước lớn, nhìn chung đầu, cánh và mặt bung có màu đen trắng, và lưng xám xanh. sống: Rừng cây gỗ và rừng thông, chủ yếu sống ở vùng rừng núi, tuy nhiên còn gặp ở đồng bằng. Sống định cư, gặp phổ biến.', NULL, 'Khắp các vùng. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3911, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Paridae', 'Bạc Má', 'FAM_274', 'Parus', NULL, 'GEN_1481', 'parusminor', 'Parus minor', 'Temminck & Schlegel, 1848', 'Bạc má', 'SPA_03944', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3912, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Paridae', 'Bạc Má', 'FAM_274', 'Parus', NULL, 'GEN_1481', 'parusmonticolus', 'Parus monticolus', 'Vigors, 1831.', 'Bạc má bụng vàng', 'SPA_03945', ' 13cm. Khác loài trên bởi kích thước nhỏ hơn, mặt bụng vàng và phiến ngoài lông cánh phớt vàng.  Các vùng rừng, xung quanh nơi trồng trọt và nương rẫy.', NULL, 'Đông Bắc và Nam Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3913, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Paridae', 'Bạc Má', 'FAM_274', 'Parus', NULL, 'GEN_1481', 'parusspilonotus', 'Parus spilonotus', 'Bonaparte , 1850', 'Bạc má mào', 'SPA_03946', ' 14cm. Vùng tai vàng rực và mào đen. Chim mái vàng lục rõ hơn và mặt bụng của con non ít đen hơn. Các vùng rừng, thường ở những nơi trống trải. Sống định cư, gặp tương đối phổ biến ở độ cao trên khoảng 900-2.200 mét.', NULL, 'Tây Bắc và Nam Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3914, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Paridae', 'Bạc Má', 'FAM_274', 'Sylviparus', NULL, 'GEN_1887', 'sylviparusmodestus', 'Sylviparus modestus', 'Burton, 1836            ', 'Bạc má rừng', 'SPA_03947', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3915, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Passeridae', 'Sẻ', 'FAM_276', 'Passer', NULL, 'GEN_1486', 'passerdomesticus', 'Passer domesticus', '(Linnaeus 1758)', 'Sẻ nhà', 'SPA_03948', 'Chim sẻ nhà thường dài khoảng 16 cm, dao động từ 14 đến 18 cm. Nó là một loài chim nhỏ gọn với bộ ngực đầy đặn và cái đầu to và tròn. Mỏ của nó mập mạp và hình nón với chiều dài ống 1,1 – 1,5 cm, cứng cáp để thích nghi với việc ăn hạt. Bộ lông của chim sẻ nhà chủ yếu có màu xám và nâu khác nhau. Các giới tính có sự dị hình mạnh mẽ: con cái chủ yếu có màu trắng ở trên và dưới, trong khi con đực có các mảng đầu màu đậm, lưng màu đỏ và phần dưới màu xám. Con đực có vương miện màu xám đen từ đỉnh mỏ đến lưng và màu nâu hạt dẻ ở hai bên đầu. Nó có màu đen xung quanh mỏ, trên cổ họng và trên các khoảng trống giữa mỏ và mắt (truyền thuyết). Nó có một sọc nhỏ màu trắng giữa các truyền thuyết và vương miện và các đốm trắng nhỏ ngay sau mắt (ống nhòm), với các mảng đen bên dưới và bên trên chúng. Phần dưới có màu xám nhạt hoặc trắng, cũng như má, tấm che tai và các sọc ở chân đầu. Phần lưng trên và lớp áo có màu nâu ấm, có những vệt đen rộng, trong khi phần lưng dưới, Chim sẻ nhà gắn liền với nơi ở và trồng trọt của con người. Nó sống thành đàn trong tất cả các mùa khi kiếm ăn, thường tạo thành đàn với các loài chim khác. Nó ngủ tập thể và trong khi sinh sản, các tổ thường được nhóm lại thành từng đám. Chim sẻ nhà cũng tham gia vào các hoạt động xã hội như tắm bụi hoặc nước và \"hát giao lưu\", trong đó các loài chim gọi nhau trong bụi rậm. Chim sẻ nhà kiếm ăn chủ yếu trên mặt đất, nhưng lại bay theo đàn trên cây và bụi rậm. Tại các trạm kiếm ăn và tổ, chim sẻ nhà cái chiếm ưu thế mặc dù kích thước nhỏ hơn và chúng có thể tranh giành con đực trong mùa sinh sản.', NULL, ' Phạm vi được giới thiệu của nó bao gồm hầu hết Bắc Mỹ, Trung Mỹ, miền nam Nam Mỹ, miền nam châu Phi, một phần của Tây Phi, Úc, New Zealand và các đảo trên khắp thế giới.', NULL, NULL, NULL, NULL, NULL, NULL, 'thainationalparks'),
(3916, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Passeridae', 'Sẻ', 'FAM_276', 'Passer', NULL, 'GEN_1486', 'passerflaveolus', 'Passer flaveolus', 'Blyth, 1844            ', 'Sẻ bụi vàng', 'SPA_03949', 'Chim đực trưởng thành: Trước mắt, cằm và họng đen. Trán, đỉnh đầu, sau cổ, hông và trên đuôi lục vàng hơi phớt xám, trước trán hơi vàng hơn. Phía sau tai có một vệt rộng màu nâu đỏ. Vai, lưng và lông bao cánh nhỏ cùng màu nhưng hơi thẫm hơn. Đuôi nâu, viền vàng lục nhạt. Lông bao cánh nhỡ đen ở phần gốc và trắng ở phần ngọn, lông bao cánh lớn đen phớt vàng lục. Lông cánh nâu đen viền vàng trừ lông ngoài cùng và có vệt hung ở gốc lông cánh sơ cấp. Tai xám lục vàng. Má và hai bên cổ và phần còn lại của mặt bụng vàng tươi, ngực và sườn hơi phớt xám.\nChim cái:có mặt lưng nâu nhạt, hơi phớt vàng lục ở đỉnh đầu và hông, màu vàng ở mặt bụng không tươi bằng ở chim đực. Mắt nâu. Mỏ đen vào mùa hè và nâu vàng nhạt vào mùa Đông. Chân nâu hồng.\nKích thước: Cánh: 63. - 75; đuôi: 52 - 54; giò: 17; mỏ: 11 - 12mm. ', NULL, 'Việt Namloài này có từ khoảng Phú Khánh vào đến Nam bộ. Loài sẻ bụng vàng này phân bố ở Miến Điện, Thái Lan và Nam Đông Dương.', NULL, NULL, NULL, NULL, NULL, NULL, 'Vncreatures'),
(3917, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Passeridae', 'Sẻ', 'FAM_276', 'Passer', NULL, 'GEN_1486', 'passermontanus', 'Passer montanus', '(Linnaeus, 1758)            ', 'Sẻ ', 'SPA_03950', '15cm. Loài chim quen thuộc ở khu vực thành phố. Con đực và cái giống nhau. Chim non có đốm hơi đỏ ở đầu và má, họng màu đen không rõ hoặc chưa có. Thỉnh thoảng tập trung kiếm ăn theo đàn lớn. sống: Thành phố, làng mạc, công viên và các vùng cây trồng.  Số lượng nhiều, phổ biến, làm tổ và kiếm ăn quanh năm.', NULL, 'Gặp trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3918, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pellorneidae', 'Chuối Tiêu', 'FAM_278', 'Malacocincla', NULL, 'GEN_1153', 'malacocinclaabbotti', 'Malacocincla abbotti', 'Blyth, 184            ', 'Chuối tiêu mỏ to', 'SPA_03951', 'Kích thước: 15-16,5 cm. Khướu bụi không có đặc điểm với bộ lông màu nâu, sườn dưới và lỗ thông hơi có màu lông hung sáng, cổ họng màu trắng, lông tơ màu xám, mắt đỏ và mỏ khá lớn. Rừng, sinh trưởng thứ sinh và các khu vực có rừng thích hợp. Thường thấy đơn lẻ hoặc theo cặp kiếm ăn gần mặt đất để tìm côn trùng và động vật không xương sống nhỏ.', NULL, ' Được tìm thấy ở Nepal, Đông Bắc Ấn Độ, lục địa Đông Nam Á, Sumatra đến Borneo.', NULL, NULL, NULL, NULL, NULL, NULL, 'Singaporebirds'),
(3919, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pittidae', 'Đuôi Cụt', 'FAM_289', 'Hydrornis', NULL, 'GEN_0919', 'hydrorniselliotii', 'Hydrornis elliotii', '(Oustalet, 1874)            ', 'Đuôi cụt bụng vằn', 'SPA_03952', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3920, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pittidae', 'Đuôi Cụt', 'FAM_289', 'Hydrornis', NULL, 'GEN_0919', 'hydrornisphayrei', 'Hydrornis phayrei', '(Blyth, 1862)', 'Đuôi cụt nâu', 'SPA_03953', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3921, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pittidae', 'Đuôi Cụt', 'FAM_289', 'Hydrornis', NULL, 'GEN_0919', 'hydrornissoror', 'Hydrornis soror', '(Wardlaw-Ramsay, 1881)            ', 'Đuôi cụt đầu xám', 'SPA_03954', 'Chim đực trưởng thành:\n\nTrán, má và tai xám. Trước mắt nâu. Đỉnh đầu lục xanh nhạt chuyển dần thành xanh nhạt xám ở gáy và thành hung nâu ở dải hẹp trên và sau mắt. Lưng, vai và lông cánh tam cấp lục tươi. Lông cánh thứ cấp và bao cánh nâu nhạt, mỗi lông đều có viền hung nhạt ở mút lông. Hông và trên đưôi xanh. Đuôi lục. Cằm trắng nhạt. Họng, ngực, hai bên cổ và sườn hung nâu. Có vệt đen ở phía sau tai, và phần gốc đen của các lông ở hai bên cổ hơi lộ ra ngoài ở đôi chỗ. Bụng và dưới đuôi trắng nhạt.\nChim cái:\nNhìn chung giống chim đực nhưng màu xỉn hơn.\nChim non.\nGần giống chim cái nhưng các vết đen ở cổ rõ hơn, trông giống như có chấm, mặt bụng ít nhiều phớt hung hay xám, trước đỉnh đầu hung hay nâu nhạt.\nMắt nâu. Mỏ nâu sừng. Chân hồng xám.', NULL, 'Phân loài đuôi cụt này phân bố ở Campuchia và Việt Nam - khoảng từ Quảng Trị trở vào Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=4&loai=&ID=5929'),
(3922, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pittidae', 'Đuôi Cụt', 'FAM_289', 'Pitta', NULL, 'GEN_1569', 'pittacyanea', 'Pitta cyanea', 'Blyth , 1843', 'Đuôi cụt đầu đỏ*', 'SPA_03955', 'Giữa đỉnh đầu có dải đen từ trán xuống gáy và dải đen thứ 2 từ trước mắt chạy qua mắt đên gáy. Các lông ở gáy kéo dài thành mào có màu đỏ hơi phớt vàng. Hai bên cổ có vệt đen rộng, tiếp theo là dải trắng ngang qua phần trên ngực và hai bên cổ. Nhìn chung mặt trên xanh tươi, mặt dưới xám lẫn hung nhạt, có vằn ngang đen. Chim cái có màu xỉn hơn. Mắt nâu thẫm. Mỏ đen. Chân hồng xám Kiếm ăn và làm tổ ở rừng rậm và vùng cây bụi thứ sinh.', NULL, 'Việt Nam: Đã tìm thấy ở tỉnh Gia Lai (Buôn lưới) và Lâm Đồng (Di Linh, Lạc Dương). vùng nam Lào.', NULL, NULL, 'Nguồn gen quý. Có giá trị khoa học và thẩm mỹ.', 'R', NULL, NULL, 'vncreatures'),
(3923, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pittidae', 'Đuôi Cụt', 'FAM_289', 'Pitta', NULL, 'GEN_1569', 'pittaelliotii', 'Pitta elliotii', '(Oustalet, 1874)', 'Đuôi cụt bụng vằn', 'SPA_03956', 'Chim trưởng thành không có vệt trắng ở cánh, mặt lưng màu xám lục ở chim đực có một dải đen rộng qua mắt đến gáy, đuôi xanh lam. Họng trắng nhạt. Ngực và bụng có vằn đen và vàng trừ một dải xanh tím thẫm. Chim cái giống chim đực nhưng đầu, họng và ngực trên có vạch nâu, dải giữa bụng màu vàng nhạt. chim non gần giống chim cái nhưng màu tối hơn. Mắt nâu. Mỏ đen. Chân hồng nhạt. Bắt đầu sinh sản vào tháng 5. Tổ hình chén, làm bằng lá khô và gân lá ở tổ tìm thấy ngày 20/5/1988 ở Gia Lai có 3 trứng. Chim đực ấp từ sáng sớm đến chiều tối, chim cái ấp về đêm. Sống định cư và làm tổ ở các sinh cảnh khác nhau của rừng nhiệt đới và trên các độ cao khác nhau (từ 50 - 100m trở nên) thường làm tổ ở vùng rừng thấp gần khe suối trên các cây gỗ nhỏ hoặc gốc đã bị chặt cách mặt đất không xa. Phần lớn thời gian kiếm ăn ở mặt đất.', NULL, 'từ Bắc vào Nam.  Đông Dương.', NULL, NULL, 'Loài đặc sản ở Đông Dương. Có giá trị khoa học và thẩm mỹ.', NULL, NULL, NULL, 'vncreatures'),
(3924, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pittidae', 'Đuôi Cụt', 'FAM_289', 'Pitta', NULL, 'GEN_1569', 'pittamoluccensis', 'Pitta moluccensis', '(Müller, 1776)', 'Đuôi cụt cánh xanh', 'SPA_03957', ' 20cm. Nhìn giống Sả đầu đen khi bay. Đỉnh đầu có sọc đen, cánh có mảng xanh da trời và mảng trắng. Mỏ dưới xám. Họng có màu trắng tương phản với phía dưới thân màu vàng cam và bụng màu đỏ tươi. Chim non màu tối hơn.  Các vùng rừng kể cả rừng ngập mặn, và nương rẫy. Phân bố đến độ cao 800 mét. Thường nghe tiếng kêu từ trên các cành cây thấp, nhất là dọc các lũy tre ven suối.  Di cư đến vào mùa đông, tương đối phổ biến.', NULL, ' Trung Trung Bộ đến Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3925, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pittidae', 'Đuôi Cụt', 'FAM_289', 'Pitta', NULL, 'GEN_1569', 'pittanipanensis', 'Pitta nipanensis', '(Hodgson, 1837)', 'Đuôi cụt gáy xanh', 'SPA_03958', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3926, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pittidae', 'Đuôi Cụt', 'FAM_289', 'Pitta', NULL, 'GEN_1569', 'pittanympha', 'Pitta nympha', 'Temminck & Schlegel, 1850', 'Đuôi cụt bụng đỏ', 'SPA_03959', '18cm. Nhìn hơi giống Đuôi cụt bụng đỏ, nhưng kích thước nhỏ hơn, sọc hai bên đỉnh đầu màu hung. Rừng thường xanh lên tới độ cao 1.000 mét. Di cư đến vào mùa đông. Hiếm. Gặp ở vùng Tam Đảo.', NULL, ' Từ vùng Đông Bắc đến Bắc và Trung Trung Bộ ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3927, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pittidae', 'Đuôi Cụt', 'FAM_289', 'Pitta', NULL, 'GEN_1569', 'pittaoatesi', 'Pitta oatesi', '(Hume, 1873)', 'Đuôi cụt đầu hung', 'SPA_03960', 'Đầu và cổ hung tươi phớt vàng. Mặt lưng lục thẫm, hông và trên đuôi hơi phớt xanh. Họng nâu phớt hồng. Phần còn lại của mặt lưng nâu thẫm. Chim cái có màu hơn xỉn hơn chim đực. Mắt nâu thẫm. Mỏ đen, chóp mỏ hơi nhạt, gốc mỏ hồng. Phần còn lại của mặt bụng nâu thẫm. Kích thước: Cánh: 112 - 128; đuôi: 64; giò: 45; mỏ: 29mm. ', NULL, 'Nam Trung bộ Việt Nam (Lâm Đồng, Đồng Nai, Bình Phước)  phân bố ở Lào và vùng Tây Bắc Việt Nam, ở độ cao trên dưới 1000m. ', NULL, NULL, 'Loài chim có màu sắc bộ lông đẹp, có giá trị khoa học, nguồn gen qúy hiếm.', NULL, NULL, NULL, 'VnCreature'),
(3928, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pittidae', 'Đuôi Cụt', 'FAM_289', 'Pitta', NULL, 'GEN_1569', 'pittaphayrei', 'Pitta phayrei', '(Blyth, 1863)            ', 'Đuôi cụt nâu', 'SPA_03961', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3929, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pittidae', 'Đuôi Cụt', 'FAM_289', 'Pitta', NULL, 'GEN_1569', 'pittasordida', 'Pitta sordida', '(Müller, 1776)', 'Đuôi cụt bụng đen', 'SPA_03962', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3930, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pittidae', 'Đuôi Cụt', 'FAM_289', 'Pitta', NULL, 'GEN_1569', 'pittasoror', 'Pitta soror', 'Wardlaw-Ramsay, 1881', 'Đuôi cụt đầu xám', 'SPA_03963', 'Chim đực trưởng thành: Trán, má và tai xám. Trước mắt nâu. Đỉnh đầu lục xanh nhạt chuyển dần thành xanh nhạt xám ở gáy và thành hung nâu ở dải hẹp trên và sau mắt. Lưng, vai và lông cánh tam cấp lục tươi. Lông cánh thứ cấp và bao cánh nâu nhạt, mỗi lông đều có viền hung nhạt ở mút lông. Hông và trên đưôi xanh. Đuôi lục. Cằm trắng nhạt. Họng, ngực, hai bên cổ và sườn hung nâu. Có vệt đen ở phía sau tai, và phần gốc đen của các lông ở hai bên cổ hơi lộ ra ngoài ở đôi chỗ. Bụng và dưới đuôi trắng nhạt. Chim cái: Nhìn chung giống chim đực nhưng màu xỉn hơn. Chim non: Gần giống chim cái nhưng các vết đen ở cổ rõ hơn, trông giống như có chấm, mặt bụng ít nhiều phớt hung hay xám, trước đỉnh đầu hung hay nâu nhạt. Mắt nâu. Mỏ nâu sừng. Chân hồng xám. Kích thước: Cánh: 150 - 120; đuôi: 55 - 63; giò: 47 - 50; mỏ: 22 - 21mm. ', NULL, 'khoảng từ Quảng Trị trở vào Nam. Phân loài đuôi cụt này phân bố ở Campuchia và Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3931, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Ploceidae', 'Sẻ', 'FAM_296', 'Paser', NULL, 'GEN_1482', 'pasermontanus', 'Paser montanus', '(Linnaeus, 1758)', 'Sẻ nhà', 'SPA_03964', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3932, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Ploceidae', 'Sẻ', 'FAM_296', 'Ploceus', NULL, 'GEN_1591', 'ploceushypoxanthus', 'Ploceus hypoxanthus', '(Sparrman, 1788)', 'Rồng rộc vàng', 'SPA_03965', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3933, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Ploceidae', 'Sẻ', 'FAM_296', 'Ploceus', NULL, 'GEN_1591', 'ploceusmanyar', 'Ploceus manyar', '(Horsfield, 1821)', 'Rồng rộc đen', 'SPA_03966', 'Con cái và con đực không sinh sản có các sọc đen đặc biệt trên ngực và hai bên sườn, sọc siêu lông và dưới ria mép màu trắng vàng, mảng cổ màu vàng và các sọc đậm ở phần trên và đỉnh đầu. Con đực trong bộ lông sinh sản có mặt đầu màu đen, vương miện màu vàng và các vệt ngực màu đen rộng hơn. Con non giống con cái nhưng thiếu các bộ phận màu vàng.  Đồng cỏ.', NULL, ' Được tìm thấy từ tiểu lục địa Ấn Độ đến Tây Nam Trung Quốc, Đông Dương, Myanmar (trừ Tenasserim), Java và Bali.', NULL, NULL, NULL, NULL, NULL, NULL, 'singaporebirds'),
(3934, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Ploceidae', 'Sẻ', 'FAM_296', 'Ploceus', NULL, 'GEN_1591', 'ploceusphilippinus', 'Ploceus philippinus', '(Linnaeus, 1766)', 'Rồng rộc', 'SPA_03967', '15cm. Giống sẻ thường, nhưng bộ lông có sọc đậm, mỏ khỏe, phần dưới cơ thể màu nâu vàng. Chim trống ở độ tuổi sinh sản có mặt nạ màu đen và đỉnh đầu vàng tươi.  Quanh đồng ruộng, vùng trồng trọt và cây bụi. Thường ngủ tập đoàn trong các bãi lau sậy. Sống thành đàn. phần hình ống kéo thẳng xuống dưới khá dài, là đặc điểm khác với tổ của các loài rồng rộc khác.\n', NULL, 'Từ Trung Trung Bộ đến Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3935, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Prionopidae', 'Phường Chèo Nâu', 'FAM_302', 'Philentoma', NULL, 'GEN_1534', 'philentomapyrhopterum', 'Philentoma pyrhopterum', '(Temminck, 1836)', 'Đớp ruồi cánh hung', 'SPA_03968', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3936, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Alophoixus', NULL, 'GEN_0066', 'alophoixusochraceus', 'Alophoixus ochraceus', '(Moore, 1854). ', 'Cành cạch bụng hung', 'SPA_03969', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3937, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Alophoixus', NULL, 'GEN_0066', 'alophoixuspallidus', 'Alophoixus pallidus', '(Swinhoe, 1870)            ', 'Cành cạch lớn', 'SPA_03970', 'Chào mào cổ họng là loài có kích thước lớn trong nhóm chào mào (khoảng 24 cm). Nó có mào da bò nhọn đặc biệt, hai bên đầu màu xám, lông họng dài màu trắng thường xòe ra, phần dưới màu vàng đậm và phần trên có màu xanh ô liu mạnh mẽ. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnamwildlife'),
(3938, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Brachypodius', NULL, 'GEN_0243', 'brachypodiusatriceps', 'Brachypodius atriceps', '(Gmelin, JF 1788)', 'Chào mào vàng đầu đen', 'SPA_03971', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3939, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Criniger', NULL, 'GEN_0485', 'crinigerpallidus', 'Criniger pallidus', '(Swinhoe, 1870)            ', 'Cành cạch lớn', 'SPA_03972', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3940, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Hemixos', NULL, 'GEN_0859', 'hemixoscastanonotus', 'Hemixos castanonotus', '(Swinhoe, 1870)', 'Cành cạch hung', 'SPA_03973', '21cm. Hai bên đầu màu hạt dẻ tương phản với họng trắng, đỉnh đầu và mào màu đen', NULL, 'Đông Bắc và Tây Nguyên. Quan sát được vào tháng 4 năm 1998 tại Dak’lap, Đắc Lắc.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/vietnamese-name/chestnut-bulbul-764'),
(3941, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Hemixos', NULL, 'GEN_0859', 'hemixosflavala', 'Hemixos flavala', '(Blyth, 1845)            ', 'Chào mào xám', 'SPA_03974', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3942, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Hemixos', NULL, 'GEN_0859', 'hemixosmcclellandii', 'Hemioxos mcclellandii', '(Horsfield, 1840)', 'Cành cạch núi', 'SPA_03975', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3943, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Hypsipetes', NULL, 'GEN_0942', 'hypsipetescastanotus', 'Hypsipetes castanotus', 'Swinhoe, 1870', 'Cành cạnh hung', 'SPA_03976', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3944, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Hypsipetes', NULL, 'GEN_0942', 'hypsipetesflavalus', 'Hypsipetes flavalus', 'Blyth, 1845', 'Cành cạch xám', 'SPA_03977', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3945, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Hypsipetes', NULL, 'GEN_0942', 'hypsipetesleucocephalus', 'Hypsipetes leucocephalius', '(P.L.S.Müller, 1776)', 'Cành cạch đen', 'SPA_03978', '25cm. Kích thước lớn, không nhìn thấy rõ mào. Bộ lông màu đen, mỏ và chân đỏ tía. Một số dạng có đầu và vai màu trắng. Một số người cho rằng, liên quan đến một số phân loài khác thường có đầu trắng ở con trưởng thành. Chim non phần dưới cơ thể màu xám nhạt. sống: Các vùng rừng núi, trảng cây bụi thứ sinh và nương rẫy. Có thể gặp ở độ cao khoảng từ 500-2.600 mét, mùa đông xuống thấp tới 120 mét.  Loài di cư, gặp phổ biến vào mùa đông với số lượng khá nhiều. Có cả quần thể định cư, sinh sản ở Cao nguyên Lâm Đồng', NULL, 'Bắc Bộ và Trung Bộ (phía Bắc đến đèo Hải Vân). ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3946, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Hypsipetes', NULL, 'GEN_0942', 'hypsipetesmadagascariensis', 'Hypsipetes madagascariensis', '(P. L. S. Müller, 1776)', 'Cành cạch đen', 'SPA_03979', '25cm. Kích thước lớn, không nhìn thấy rõ mào. Bộ lông màu đen, mỏ và chân đỏ tía. Một số dạng có đầu và vai màu trắng. Một số người cho rằng, liên quan đến một số phân loài khác thường có đầu trắng ở con trưởng thành. Chim non phần dưới cơ thể màu xám nhạt. Tiếng kêu: Kéo dài như tiếng mèo kêu và tiếng quác quác ầm ĩ.', NULL, 'Bắc Bộ và Trung Bộ (phía Bắc đến đèo Hải Vân', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3947, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Hypsipetes', NULL, 'GEN_0942', 'hypsipetesmcclellandii', 'Hypsipetes mccellandii', 'Horsfield, 1840', 'Cành cạch núi', 'SPA_03980', ' 24cm. Kích thước lớn, có mào lông, cánh và đuôi màu xanh, nhìn thấy rõ khi bay. Phần lớn có màu trắng nhạt ở phía bụng. Thỉnh thoảng gặp bay thành đàn lớn. ống: Các vùng rừng, có thể gặp lên đến độ cao khoảng từ 800-2.600 mét.', NULL, ' Bắc Bộ, Nam Trung Bộ (Tây Nguyên). ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3948, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Hypsipetes', NULL, 'GEN_0942', 'hypsipetespropuipuus', 'Hypsipetes propinqus', '(Oustalet, 1903)', 'Cành cạch nhỏ', 'SPA_03981', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3949, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Hysipetes', NULL, 'GEN_0944', 'hysipetesflavalus', 'Hysipetes flavalus', NULL, 'Cành cạch xám', 'SPA_03983', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3950, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Hysipetes', NULL, 'GEN_0944', 'hysipetesmadagascarriensis', 'Hysipetes madagascarriensis', '(P. L. S. Müller, 1776)', 'Cành cạch đen', 'SPA_03984', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3951, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Iole', NULL, 'GEN_0966', 'iolepropinqua', 'Iole propinqua', '(Oustalet, 1903)            ', 'Cành cạch nhỏ', 'SPA_03985', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3952, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Pycnonotus', NULL, 'GEN_1694', 'pycnonotusatriceps', 'Pycnonotus atriceps', '(Temminck , 1822)', 'Chào mào vàng đầu đen', 'SPA_03987', ' bộ lông chủ yếu là màu vàng ô liu với đầu màu đen xanh bóng. Một dạng màu xám trong đó phần lớn màu vàng ô liu được thay thế bằng màu xám cũng tồn tại. Nó giống chào mào đen, nhưng có mắt xanh (mặc dù không đáng tin cậy ở cá con), chóp đuôi rộng màu vàng và không bao giờ có mào (tuy nhiên, một số phân loài của chào mào đen về cơ bản cũng không có mào, nhưng chúng có cổ họng màu đỏ hoặc vàng). ăn trái cây nhỏ và quả mọng, nhưng cũng ăn côn trùng. Nó thường xuất hiện thành từng đàn nhỏ, bao gồm 6-8 cá thể.', NULL, ' Nó được tìm thấy trong các khu rừng ở Đông Nam Á.', NULL, NULL, NULL, NULL, NULL, NULL, 'thainationalparks'),
(3953, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Pycnonotus', NULL, 'GEN_1694', 'pycnonotusaurigaster', 'Pycnonotus aurigaster', '(Vieillot, 1818)            ', 'Bông lau tai trắng', 'SPA_03988', '20cm. Đầu đen nhạt, phần trên cơ thể màu nâu đất lẫn đốm trắng nhạt ở lông bao đuôi trên, mút đuôi trắng. Phía dưới đuôi đỏ tươi giống chào mào. Lông trán có thể dựng lên tạo thành mào thấp. Chim non có màu vàng nhạt ở dưới đuôi. Tiếng kêu: Có âm hưởng hay hơn tiếng Chào mào.', NULL, 'Khắp các vùng trong cả nước.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3954, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Pycnonotus', NULL, 'GEN_1694', 'pycnonotusbarbatus', 'Pycnonotus barbatus', '(Desfontaines, 1789)', 'Bông lau đít vàng', 'SPA_03989', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3955, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Pycnonotus', NULL, 'GEN_1694', 'pycnonotusblanfordi', 'Pycnonotus blanfordi', 'Strickland, 1844            ', 'Bông lao tai vằn', 'SPA_03990', 'Bông lau tai vằn là chim có kích thước trung bình (khoảng 18 cm) trong họ chào mào. Chim trống và chim mái giống nhau với thân trên màu nâu, thân dưới màu xám nhạt và dưới đuôi màu vàng. Chúng rất nổi bật với mảng tai nhiều sọc trắng (là lý do chúng được đặt tên) và mỏ nâu, chuyển dần sang hồng về gốc mỏ. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'vietnamwildlife'),
(3956, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Pycnonotus', NULL, 'GEN_1694', 'pycnonotuscafer', 'Pycnonotus cafer var. aurigaste', ' (Linnaeus, 1766)', 'Bông lao đít đỏ', 'SPA_03991', ' dễ dàng nhận biết nhờ mào ngắn khiến đầu có hình vuông. Cơ thể có màu nâu sẫm với hoa văn có vảy trong khi đầu sẫm màu hơn hoặc đen. Phần mông có màu trắng trong khi lỗ huyệt có màu đỏ. Đuôi màu đen có màu trắng. chim non có màu xỉn hơn chim trưởng thành.  ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'thainationalparks'),
(3957, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Pycnonotus', NULL, 'GEN_1694', 'pycnonotusfinlaysoni', 'Pycnonotus finlaysoni', 'Strickland, 1844            ', 'Bông lau họng vạch', 'SPA_03992', 'Chào mào họng sọc phát triển chiều dài khoảng 20 cm (8 in). Bộ lông của cả hai giới chủ yếu có màu nâu xỉn ngoại trừ trán, tấm che tai, cổ họng và phần trên ngực có những vệt màu vàng đậm. Mép cánh trước và lông đuôi ngoài có màu hơi vàng, phần ức dưới và bụng có sọc trắng, khu vực xung quanh lỗ thông hơi có màu vàng. Con non tương tự như con trưởng thành nhưng màu vàng nhạt hơn.', NULL, 'bán đảo Malaysia, Thái Lan và Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3958, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Pycnonotus', NULL, 'GEN_1694', 'pycnonotusflavescens', 'Pycnonotus flavescens', 'Blyth, 1845', 'Bông lau vàng', 'SPA_03993', 'Bông lau vàng là một loài có kích thước lớn trong nhóm bông lau (khoảng 22cm). Chim có đầu màu xám với mỏ dày đen, mày trước mắt và vành mắt màu trắng, đỉnh đầu có vảy đen và mào thấp, thân trên màu xanh olive nhạt với cánh màu vàng đậm, thân dưới màu vàng đậm dần ra hai bên sườn, lông bao đuôi dưới màu vàng sáng. Chim trống và chim mái giống nhau. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'vietnamwildlif'),
(3959, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Pycnonotus', NULL, 'GEN_1694', 'pycnonotusgoiavier', 'Pycnonotus goiavier', '(Scopoli , 1886)', 'Bông lau mày trắng', 'SPA_03994', 'Chim trưởng thành:\n\nMào ngắn và dày. Mặt lưng nâu đất, dọc giữa lông mày thẫm hơn hai bên, mép các lông cánh sơ cấp có phớt lục vàng. Mép cánh trắng vàng nhạt. Phía trên mắt có dảI rộng trắng kéo dài từ sau mỏ đến gáy. Cằm và họng trắng. Tai nâu rất nhạt. Mặt bụng trắng, có vệt nâu ngực và hai bên sườn. Dưới đuôi và phần sau bụng vàng tươi. Đùi nâu nhạt hơi phớt vàng. Mắt nâu, mỏ và chân đen.\nKích thước: Cánh (đực): 85 - 94, (cái): 80 - 88; đuôi: 83; giò: 20; mỏ: 15mm ', NULL, 'Việt Nam chỉ mới tìm thấy loài này ở Biên Hoà. Nam Thái Lan, Miến Điện, Nam Đông Dương, Mã Lai và Xummatra.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(3960, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Pycnonotus', NULL, 'GEN_1694', 'pycnonotusjocosus', 'Pycnonotus jocosus', '(Linnaeus, 1758)            ', 'Chào mào', 'SPA_03995', 'Mào dài và nhọn. Trán, đỉnh đầu, mào, trước mắt và hai bên đầu đen. Mặt lưng, kể cả cánh và đuôi nâu, các lông cánh sơ cấp viền màu nhạt hơn và mút các lông đuôi hai bên có vệt trắng. Phía dưới mắt có việt đỏ thắm. Má trắng viền đen. Cằm và họng trắng. Hai bên ngực có vệt nâu thẫm lớn tạo thành vòng đứt đoạn ở trước ngực. Bụng trắng nhạt hay trắng, hai bên sườn và đùi nâu nhạt. Dưới đuôi đỏ. Mắt nâu. Mỏ và chân đen. Cánh: (đực): 85 - 90, (cái): 82 - 87; đuôi: 86 - 96; giò: 21 - 22; mỏ: 14 - 15mm ', NULL, 'Ở Việt Nam loài này rất phổ biến từ biên giới phía Bắc cho đến Hải Vân và Kontum Bắc Ấn Độ, Bắc Miến Điện, Bắc Thái Lan, Nam Trung Quốc và Đông Dương', NULL, NULL, 'Có giá trị khoa học và thẩm mỹ. Là đối tượng nghiên cứu khoa học và giúp cân bằng sinh thái trong tự nhiên', NULL, NULL, NULL, 'VnCreature'),
(3961, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Pycnonotus', NULL, 'GEN_1694', 'pycnonotusmelanicterus', 'Pycnonotus melanicterus', '(Gmelin, 1789)            ', 'Chào mào vàng mào đen', 'SPA_03996', 'Chào mào mũ đen hầu như không có mào và có cổ màu vàng và mắt màu nâu. Nó có màu xanh vàng ở trên và màu vàng ở dưới. Đuôi có màu nâu và kết thúc bằng một đầu màu trắng. Con đực có tròng mắt màu đỏ và con cái có tròng mắt màu nâu. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3962, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Pycnonotus', NULL, 'GEN_1694', 'pycnonotussinensis', 'Pycnonotus sinensis', '(Gmelin, 1789).', 'Bông lau trung quốc', 'SPA_03997', '19cm. Được phân biệt bởi đỉnh đầu phía sau màu trắng, túm lông hơi xù lên trông giống mào. Chim trưởng thành có viền cánh và đuôi màu xanh-vàng. Chim non không có điểm trắng ở đầu, sống thành đàn vào tiết lập thu. Tiếng kêu: Ầm ĩ và kém phần trong trẻo so với Chào mào.', NULL, 'Bắc Bộ và Trung Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3963, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Pycnonotus', NULL, 'GEN_1694', 'pycnonotussp', 'Pycnonotus sp.', NULL, 'Chào mào trắng', 'SPA_03998', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3964, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Pycnonotus', NULL, 'GEN_1694', 'pycnonotusstriatus', 'Pycnonotus striatus', '(Blyth, 1842).', 'Chào mào vạch', 'SPA_03999', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3965, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Pycnonotus', NULL, 'GEN_1694', 'pycnonotusxanthorrhous', 'Pycnonotus xanthorrhous', 'Anderson, 1869', 'Bông lau ngực nâu', 'SPA_04000', '20cm. Giống như Bông lau đít đỏ, nhưng dưới đuôi màu vàng tươi, họng màu trắng. Sống ở rừng thứ sinh vùng cao. sống: Vùng cây bụi trống trải, nơi có độ cao từ khoảng 1.200 mét trở lên.', NULL, 'Tây Bắc. Đã tìm thấy ở Lào Cai và Sapa. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3966, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Rubigula', NULL, 'GEN_1762', 'rubigulamelanictera', 'Rubigula melanictera', '(Gmelin, 1789)', 'Chào mào vàng mào đen', 'SPA_04001', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3967, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Pycnonotidae', 'Chào Mào', 'FAM_312', 'Spizixos', NULL, 'GEN_1850', 'spizixossemitorques', 'Spizixos semitorques', 'R. Swinhoe, 1861', 'Chào mào khoang cổ', 'SPA_04002', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3968, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Scotocercidae', 'Chích Việt Nam', 'FAM_338', 'Horornis', NULL, 'GEN_0906', 'hororniscanturians', 'Horornis canturians', '(Temminch, 1836)', 'Chích bụi rậm ', 'SPA_04003', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
