(3970, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Scotocercidae', 'Chích Việt Nam', 'FAM_338', 'Horornis', NULL, 'GEN_0906', 'horornisflavolivaceus', 'Horornis flavolivaceus', '(Blyth, 1845)', 'Chích mày vàng', 'SPA_04005', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
