(3972, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sittidae', 'Trèo Cây', 'FAM_345', 'Sitta', NULL, 'GEN_1832', 'sittacinnamoventris', 'Sitta cinnamoventris', 'Blyth, 1842', 'Trèo cây bụng hung', 'SPA_04007', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3973, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sittidae', 'Trèo Cây', 'FAM_345', 'Sitta', NULL, 'GEN_1832', 'sittafarinosa', 'Sitta farinosa', 'A.Gray ex Torr., 1848', 'Trèo cây lung den', 'SPA_04008', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3974, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sittidae', 'Trèo Cây', 'FAM_345', 'Sitta', NULL, 'GEN_1832', 'sittafrontalis', 'Sitta frontalis', '(Swainson, 1820)            ', 'Trèo cây trán đen', 'SPA_04009', ' 12cm. Phía lưng có màu xanh violet, mỏ màu đỏ và trán đen. Con trống có vành mắt mảnh màu đen. Chim non có mỏ đen  Sống ở rừng, thường kiếm ăn trong đàn hỗn hợp. Sống định cư, gặp phổ biến lên tới độ cao khoảng 1.800 mét.', NULL, 'Các vùng rừng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3975, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sittidae', 'Trèo Cây', 'FAM_345', 'Sitta', NULL, 'GEN_1832', 'sittanagaensis', 'Sitta nagaensis', 'Godwin-Austen, 1874', 'Trèo cây bung hung', 'SPA_04010', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3976, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sittidae', 'Trèo Cây', 'FAM_345', 'Sitta', NULL, 'GEN_1832', 'sittaneglecta', 'Sitta neglecta', 'Walden, 1870', 'Trèo cây bụng vàng', 'SPA_04011', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3977, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sittidae', 'Trèo Cây', 'FAM_345', 'Sitta', NULL, 'GEN_1832', 'sittasolangiae', 'Sitta solangiae', '(Delacour & Jabouille, 1930)', 'Trèo cây mỏ vàng', 'SPA_04012', '13cm. Chim trống và chim mái trưởng thành có màu lông giống nhau. Bộ lông có màu xanh da trời; đầu và cổ màu nhạt hơn. Mỏ vàng, mút mỏ đen nhạt. Chân xám.', NULL, 'Tây Bắc, Bắc Trung Bộ và Tây Nguyên. Đã tìm thấy ở Lào Cai (Sa Pa), Thanh Hóa (Khu bảo tồn Pù Hu), Gia Lai (Khu bảo tồn Kon Ka Kinh), Kon Tum (Khu bảo tồn Ngọc Linh), Lâm Đồng (núi Langbian).', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3978, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sturnidae', 'Sáo', 'FAM_355', 'Acridotheres', NULL, 'GEN_0027', 'acridotheresburmannicus', 'Acridotheres burmannicus', '(Jerdon, 1862).', 'Sáo sậu đầu trắng', 'SPA_04013', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3979, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sturnidae', 'Sáo', 'FAM_355', 'Acridotheres', NULL, 'GEN_0027', 'acridotherescinereus', 'Acridotheres cinereus', 'Bonaparte, 1851', 'Sáo mỏ vàng', 'SPA_04014', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3980, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sturnidae', 'Sáo', 'FAM_355', 'Acridotheres', NULL, 'GEN_0027', 'acridotherescristatellus', 'Acridotheres cristatellus', '(Linnaeus, 1758)', 'Sáo đen, Sáo mỏ ngà', 'SPA_04015', '26cm. Đỉnh đầu có mào. Bộ lông màu đen, thỉnh thoảng nhìn thấy vệt trắng ở cánh, thường thấy rõ khi bay. Mút lông đuôi trắng và bao dưới đuôi có vằn trắng hẹp. Mào lông ở chim non không rõ. sống: Các khu vực trồng trọt, vùng đất trống trải, làng bản và đồng ruộng. Tìm mồi quanh đàn gia súc. Di chuyển và ngủ theo đàn.  Sống định cư ở các vùng địa hình thấp. Gặp phổ biến.', NULL, 'Từ Bắc Bộ đến khoảng Bắc đèo Hải Vân. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3981, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sturnidae', 'Sáo', 'FAM_355', 'Acridotheres', NULL, 'GEN_0027', 'acridotheresfuscus', 'Acridotheres fuscus', '(Wagler, 1827)', 'Sáo mỏ vàng', 'SPA_04016', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3982, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sturnidae', 'Sáo', 'FAM_355', 'Acridotheres', NULL, 'GEN_0027', 'acridotheresgrandis', 'Acridotheres grandis', 'Linnaeus', 'Sáo mỏ vàng', 'SPA_04017', '25cm. Tương tự như Sáo đen nhưng mỏ vàng, mút đuôi trắng rộng và lông bao dưới đuôi trắng.', NULL, ' Tất cả các vùng trong cả nước.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3983, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sturnidae', 'Sáo', 'FAM_355', 'Acridotheres', NULL, 'GEN_0027', 'acridotherestristis', 'Acridotheres tristis', '(Linnaeus, 1766).', 'Sáo nâu', 'SPA_04018', '25cm. Chim trưởng thành có bộ lông màu nâu tối, đầu đen. Mỏ, da vùng mắt và giò có màu vàng. Chim non có màu xỉn hơn. Khi bay thấy rõ vạt lông trắng ở cánh.', NULL, 'Khắp các vùng trong cả nước.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3984, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sturnidae', 'Sáo', 'FAM_355', 'Ampeliceps', NULL, 'GEN_0081', 'ampelicepscoronatus', 'Ampeliceps coronatus', '(Blyth, 1842)', 'Sáo vàng', 'SPA_04019', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3985, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sturnidae', 'Sáo', 'FAM_355', 'Gracula', NULL, 'GEN_0789', 'graculareligiosa', 'Gracula religiosa', '(Linnaeus, 1758)            ', 'Yểng', 'SPA_04020', 'Chim yểng lớn có chiều dài 29 cm, lông màu đen xanh biếc, mỏ màu vàng đỏ, đầu có lông sọc vàng Chúng ăn các loại côn trùng và trái cây', NULL, 'Phân bố rộng rãi ở đồng bằng, trung du, miền núi Yểng sinh sống ở vùng dưới chân núi Himalaya từ Kumaon, Ấn Độ về phía đông tới Nepal, Sikkim, Bhutan và Arunachal Pradesh ở những nơi có độ cao lên đến 2.000 m[3]. Yểng cũng sống tại Thái Lan, Indonesia, Việt Nam và nhiều nơi ở Đông Nam Á', NULL, NULL, 'Có giá trị khoa học và thẩm mỹ. Là đối tượng nghiên cứu khoa học và giúp cân bằng sinh thái trong tự nhiên', NULL, NULL, NULL, 'wiki'),
(3986, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sturnidae', 'Sáo', 'FAM_355', 'Gracupica', NULL, 'GEN_0790', 'gracupicacontra', 'Gracupica contra', '(Linnaeus, 1758).', 'Sáo đá châu Á', 'SPA_04021', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3987, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sturnidae', 'Sáo', 'FAM_355', 'Gracupica', NULL, 'GEN_0790', 'gracupicanigricollis', 'Gracupica nigricollis', '(Paykull, 1807)', 'Sáo sậu', 'SPA_04022', 'Kích thước lớn hơn so với các loài sáo khác. Bộ lông có nhiều màu sắc, vòng cổ đen, đầu trắng, mặt bụng trắng, lưng đen. Chim non có màu đen và xám nhạt. ', NULL, 'Khắp các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3988, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sturnidae', 'Sáo', 'FAM_355', 'Sturnus', NULL, 'GEN_1876', 'sturnusburmannicus', 'Sturnus burmannicus', '(Jerdon, 1862)', 'Sáo sậu đầu trắng', 'SPA_04023', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3989, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sturnidae', 'Sáo', 'FAM_355', 'Sturnus', NULL, 'GEN_1876', 'sturnusmalabaricus', 'Sturnus malabaricus', '(Gmelin, 1789)            ', 'Sáo đá đuôi hung', 'SPA_04024', ' phần trên màu xám và phần còn lại hơi đen, nhưng màu sắc của bộ lông còn lại phụ thuộc vào phân loài. phần dưới (bao gồm cả đuôi dưới) có màu hung, phần dưới có màu hung đỏ, đặc biệt là ở hai bên sườn, có đầu màu xám nhạt với các vệt màu trắng . Cả hai phân loài đều có tròng mắt màu trắng và mỏ màu vàng với nền màu xanh nhạt. Giới tính tương tự nhau, nhưng con non có phần dưới màu trắng và chỉ có đầu lông đuôi màu hạt dẻ.  tìm thấy ở vùng rừng thưa và vùng trồng trọt. Chim sáo đuôi hạt dẻ xây tổ trong hang. Ổ đẻ bình thường là 3-5 quả trứng.  ăn tạp, ăn trái cây, mật hoa và côn trùng. Chúng bay theo đàn chặt chẽ và thường nhanh chóng thay đổi hướng với sự đồng bộ cao.', NULL, ' đông bắc Ấn Độ, Nepal, Bhutan, Bangladesh và tây bắc Miến Điện', NULL, NULL, NULL, NULL, NULL, NULL, 'thainationalparks'),
(3990, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sturnidae', 'Sáo', 'FAM_355', 'Sturnus', NULL, 'GEN_1876', 'sturnusnigricollis', 'Sturnus nigricollis', '(Paykull, 1807).', 'Sáo sậu', 'SPA_04025', 'Chim trưởng thành: Đầu trắng, tiếp theo, là một vòng đem qoanh cổ, ở phía sau cổ, tiếp theo vòng đen là một dải trắng hẹp. Hông trắng. Toàn bộ mặt lưng và các lông cánh nâu thẫm, trừ một số lông bao cánh nhỡ, bao cánh lớn, vai và các lông cánh thứ cấp có mút trắng. Lông bao cánh sơ cấp trắng. đuôi nâu thẫm, mút đuôi trắng, các lông đuôi hai bên có viền trắng ở mép ngoài. Mặt bụng trắng. Chim non đầu và cổ hung nhạt. Mắt nâu; Da trần quanh mắt vàng. Mỏ nâu đỏ. Chân trắng bẩn. Kích thước: Cánh: 140 - 158; đuôi: 87 - 94; giò: 41 - 42 ; mỏ 29 - 30 mm. ', NULL, 'Việt Nam có ở hều hết các tỉnh từ Bắc đến Nam. Sáo sậu phân bố ở Nam Miền Điện, Thái Lan, Lào, Việt Nam, Nam Trung Quốc và Campuchia.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(3991, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sturnidae', 'Sáo', 'FAM_355', 'Sturnus', NULL, 'GEN_1876', 'sturnussericeus', 'Sturnus sericeus', 'Gmelin, 1788.', 'Sáo đá đầu trắng', 'SPA_04026', '24cm. Toàn bộ đầu có màu lông trắng. Khi bay để lộ mảng lông trắng lớn ở gốc lông cánh sơ cấp. Mỏ đỏ. Chim mái và chim non có màu tối.  Chỗ cây bụi, vùng trồng trọt và vườn nhà, các vùng đồng bằng trống trải và cả ở rừng ngập mặn ven biển. Thỉnh thoảng chỉ gặp về mùa đông, khi chúng di cư đến các vùng thấp từ phía Nam Trung Quốc. Trước đây đã thu vật mẫu ở Lạng Sơn, Bắc Kạn, Hà Nội, Hải Hưng và Huế.', NULL, 'Bắc Bộ và Trung Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(3992, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sturnidae', 'Sáo', 'FAM_355', 'Sturnus', NULL, 'GEN_1876', 'sturnussinensis', 'Sturnus sinensis', '(Gmelin, JF, 1788)', 'Sáo đá Trung Quốc', 'SPA_04027', '20cm. Mút các lông đuôi trắng. Chim trống có đám lông trắng trên cánh nhìn rất rõ, còn ở chim mái vệt trắng nhỏ và mờ hơn. sống: Các khu vực trống trải hoặc có cây bụi, và ở cả vùng thành thị. Hiếm khi gặp kiếm ăn trên mặt đất. Loài di cư, gặp ở các vùng địa hình thấp.', NULL, 'Các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3993, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sturnidae', 'Sáo', 'FAM_355', 'Sturnus', NULL, 'GEN_1876', 'sturnussturninus', 'Sturnus sturninus', '(Pallas, 1776)', 'Sáo đá lưng đen', 'SPA_04028', '19cm. Chim trưởng thành có lưng đen xanh lục ánh thép, gáy tối màu; đầu, cổ, ngực và mặt bụng màu xám.', NULL, 'Đông Bắc và Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3994, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sturnidae', 'Sáo', 'FAM_355', 'Sturnus', NULL, 'GEN_1876', 'sturnusvulgaris', 'Sturnus vulgaris', 'Linnaeus, 1758', 'Sáo đá xanh', 'SPA_04029', '22cm. Bộ lông có nhiều màu xen kẽ, mỏ nhọn sắc, màu vàng. Mùa đông có rất nhiều đốm trắng và nâu sẫm, mỏ màu nâu. Chim non màu nâu tối, họng hơi xám và mỏ màu tối. sống: Chỉ mới gặp ở vùng đồng bằng.', NULL, 'Vùng Đông Bắc. Gặp ở tỉnh Hải Hưng cũ vào mùa đông năm 1974,75 và 76. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(3995, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Abroscopus', NULL, 'GEN_0005', 'abroscopusalbogularis', 'Abroscopus albogularis', '(Hodgson, 1854)', 'Chích đớp ruồi mặt hung', 'SPA_04030', '10cm. Kích thước nhỏ, mắt đen, bay nhảy liên tục, mặt có màu hung. Chim non chỉ có lông mày màu vàng chanh. Tiếng kêu: ‘dri’ nghe như tiếng côn trùng, ríu rít, xao động.', NULL, 'Tây Bắc và vùng Nam của Trung Trung Bộ. Trước đây đã thu mẫu ở Tam Đảo.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(3996, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Abroscopus', NULL, 'GEN_0005', 'abroscopushodgsoni', 'Abroscopus hodgsoni', '(Moore, 1854).', 'Chích đớp ruôi mỏ rộng', 'SPA_04031', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3997, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Abroscopus', NULL, 'GEN_0005', 'abroscopusschisticeps', 'Abroscopus schisticeps', '(Gray, 1846). ', 'Chích đớp ruôi mặt đen', 'SPA_04032', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3998, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Abroscopus', NULL, 'GEN_0005', 'abroscopussuperciliaris', 'Abroscopus superciliaris', '(Blyth, 1859).', 'Chích đớp ruồi mỏ vàng', 'SPA_04033', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3999, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Bradypterus', NULL, 'GEN_0250', 'bradypterusluteoventris', 'Bradypterus luteoventris', '(Hodgson, 1845)', 'Chích bụi rậm nâu', 'SPA_04034', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4000, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Bradypterus', NULL, 'GEN_0250', 'bradypterusseebohmi', 'Bradypterus seebohmi', '(Ogilvie-Grant, 1895)', 'Chích nâu đỏ', 'SPA_04035', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4001, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Bradypterus', NULL, 'GEN_0250', 'bradypterusthoracicus', 'Bradypterus thoracicus', '(Blyth, 1845)', 'Chích họng vạch', 'SPA_04036', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4002, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Cettia', NULL, 'GEN_0351', 'cettiacanturians', 'Cettia canturians', '(Swinhoe, 1860)', 'Chích bụi rậm', 'SPA_04037', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4003, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Cettia', NULL, 'GEN_0351', 'cettiadiphone', 'Cettia diphone', '(Kittlitz, 1830).', 'Chích ngực hung', 'SPA_04038', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4004, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Cettia', NULL, 'GEN_0351', 'cettiaflavolivacea', 'Cettia flavolivacea', '(Blyth, 1845)', 'Chích mày vàng', 'SPA_04039', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4005, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Cettia', NULL, 'GEN_0351', 'cettiapallidipes', 'Cettia pallidipes', '(Blanford, 1872)', 'Chích vân nam', 'SPA_04040', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4006, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Cettia', NULL, 'GEN_0351', 'cettiasquameiceps', 'Cettia squameiceps var. urosphena', '(Swinhoe, R 1863)', 'Chích đuôi ngắn', 'SPA_04041', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4007, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Megalurus', NULL, 'GEN_1181', 'megaluruspalustris', 'Megalurus palustris', '(Horsfield, 1821)', 'Chiền chiện lớn', 'SPA_04042', 'Nó có hình dáng giống chim sẻ, kích thước lớn hơn và đuôi dài hơn, với phần trên màu nâu nhạt có sọc đen nổi bật. Nó có bộ lông màu trắng nhạt, vương miện màu hung đỏ, phần dưới màu trắng với các vệt màu nâu mịn ở vùng ngực và sườn. Ăn động vật không xương sống nhỏ, bao gồm nhện (Araneae), nhiều loại côn trùng và ấu trùng của chúng. Được tìm thấy ở vùng đất ngập nước, đồng cỏ, đất nông nghiệp, vườn, v.v.', NULL, ' Nó được tìm thấy ở Bangladesh, Campuchia, Trung Quốc, Ấn Độ, Indonesia, Lào, Malaysia, Myanma, Nepal, Pakistan, Philippines, Thái Lan và Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'Indiabiodiversity'),
(4008, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Orthotomus', NULL, 'GEN_1403', 'orthotomusatrogularis', 'Orthotomus atrogularis', '(Temminck, 1836)            ', 'Chích bông cánh vàng', 'SPA_04043', 'Đỉnh đầu hung tươi, mặt lưng có màu lục bóng hơn, mặt bụng xám với họng và bụng trắng nhạt, dưới đuôi và dưới cánh vàng tươi. Mắt nâu nhạt. Mỏ trên nâu, mỏ dưới nâu hồng nhạt. Chân nâu hồng nhạt. Cánh: 40 - 45; đuôi: 34; giò: 19; mỏ: 15mm ', NULL, 'Có thể gặp loài này ở khắp mọi nơi từ Bắc đến Nam Miến Điện, Thái Lan, Tây Nam Trung Quốc (Vân Nam), Đông Dương, Mã Lai và Xumatra', NULL, NULL, 'Có giá trị khoa học và thẩm mỹ. Là đối tượng nghiên cứu khoa học và giúp cân bằng sinh thái trong tự nhiên', NULL, NULL, NULL, 'VnCreature'),
(4009, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Orthotomus', NULL, 'GEN_1403', 'orthotomuscuculatus', 'Orthotomus cucularus', 'Temminck, 1836', 'Chích bông bụng vàng', 'SPA_04044', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4010, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Orthotomus', NULL, 'GEN_1403', 'orthotomusruficeps', 'Orthotomus ruficeps', '(Lesson, 1830)', 'Chim chích', 'SPA_04045', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4011, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Orthotomus', NULL, 'GEN_1403', 'orthotomussepium', 'Orthotomus sepium', 'Lesson, 1830', 'Chích bông nâu', 'SPA_04046', 'Chim trưởng thành:\n\nMặt trên của đầu từ trước mắt đến gáy hung nâu tươi. Lưng, vai, hông và phần lộ ra ngoài của bao cánh nâu xám thẫm. Lông cánh sơ cấp và thứ cấp có mép viền hung hồng. Trên đuôi hung vàng xám. Đuôi hung nâu, với phần gốc đen nhạt. Nửa dưới đầu trắng. Phần còn lại của mặt bụng trắng phớt vàng hung và hơi thẫm hơn ở dưới đuôi. Mắt nâu vàng. Mỏ trên nâu sừng, mỏ dưới nâu vàng. Chân nâu nhạt.\nKích thước: Cánh: 46 - 52; đuôi: 34 - 43; giò: 19 - 20; mỏ: 14 - 16mm. ', NULL, 'Việt Nam chỉ mới tìm thấy loài này ở Tây Ninh và Trà Vinh. Loài chích bông nâu này phân bố ở Miến Điện, Thái Lan, Mã Lai, Bocnêô và Xumatra.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4012, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Orthotomus', NULL, 'GEN_1403', 'orthotomussutorius', 'Orthotomus sutoris', '(Pennant, 1769)', 'Chích bông đuôi dài', 'SPA_04047', '12cm (không kể đuôi của con đực). Phần trước đỉnh đầu màu hung, đuôi dài (thường vểnh). Chim non đỉnh đầu không có màu hung. Thỉnh thoảng phần gốc lông màu xám nhìn thấy ở vùng cổ (đặc biệt là khi chim hót) tạo nên nhiều mảng tối.  Cây bụi thứ sinh, tre nứa, vườn làng và những nơi rậm rạp. Thường sống ở những bụi cây thấp, bạo dạn. Sống định cư phổ biến, gặp lên tới độ cao khoảng 1.500 mét, nhưng chủ yếu vẫn ở đai thấp nhiều hơn.', NULL, 'Khắp các vùng trong cả nước. Gặp tại nhiều nơi ở các tỉnh đồng bằng sông Cửu Long trong năm 1999. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Birdwatchingvietnam'),
(4013, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopusaffinis', 'Phylloscopus affinis', '(Tickell, 1833).', 'Chích bụng hung', 'SPA_04048', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4014, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopusarmandii', 'Phylloscopus armandii', '(Milne-Edwards, 1865).', 'Chích họng trắng', 'SPA_04049', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4015, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopusborealis', 'Phylloscopus borealis', '(Blasius, JH, 1858).', 'Chích phương bắc', 'SPA_04050', '13cm. Lông mày màu trắng, dễ nhận biết, có một vằn trắng ở cánh (thỉnh thoảng có vằn cánh thứ hai mờ mờ), lông bao tai nhiều vằn, đỉnh đầu và lưng xám nhạt. Bụng trắng. Trông dài hơn và có mỏ khỏe hơn chim Chích mày lớn. Thường có mút lông bao cánh nhỏ có màu trắng nhạt khi cánh khép lại.  sống: Trong rừng gỗ và chỗ cây bụi nằm ở trảng trống.  Loài di cư. Gặp phổ biến trong các vùng phân bố lên đến độ cao khoảng 1.800 mét về mùa đông.', NULL, 'Tất cả các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4016, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopuscoronatus', 'Phylloscopus coronatus', '(Temmick&Schlegel, 1847)            ', 'Chích mào vàng', 'SPA_04051', '3cm. Thuộc loại chim chích lớn chuyên sống trên cây có màu tươi, đỉnh đầu có sọc không rõ. Khác với Chích phương bắc cùng cỡ bởi màu sáng hơn, phần dưới thân trắng hơn, bao dưới đuôi màu nhạt hơn, phía lưng màu xanh tươi và chỉ có một vằn cánh màu vàng.  sống: Các vùng rừng thưa cây gỗ thưa và rừng ngập mặn. Loài di cư, gặp lên tới độ cao khoảng 1.800 mét, nhưng chủ yếu vẫn ở đai thấp. Không phổ biến.', NULL, 'Bắc Bộ và Nam Bộ. Trước đây đã thu mẫu ở Lai Châu, Hải Phòng và một vài nơi ở miền Đông Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4017, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopusdavisoni', 'Phylloscopus davisoni', '(Oates, 1889)            ', 'Chích đuôi trắng', 'SPA_04052', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4018, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopusfuscatus', 'Phylloscopus fuscatus', '(Blyth, 1842)            ', 'Chim chích nâu', 'SPA_04053', '12cm. Dễ dàng nhận biết bằng tiếng kêu chói tai lặp lại liên tục ‘tschack-tschak’ khi chim di chuyển một cách im lặng qua các bụi cây và lau sậy. Phía lưng màu xám nâu xám tối; mày hơi trắng dễ nhận thấy; thân dưới trắng phớt xám, thường có lẫn các vết xám ở sườn và bụng. sống: Bụi rậm, bãi cỏ, vùng ngập nước nội địa và rừng ngập mặn. Loài di cư phổ biến, có thể gặp lên tới độ cao khoảng trên 1.000 mét.', NULL, 'Từ Bắc Bộ đến Nam Bộ ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4019, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopusinornatus', 'Phylloscopus inornatus', '(Blyth, 1842)            ', 'Chích mày vàng', 'SPA_04054', '11cm. Nhận dạng bởi hai dải màu trắng nhạt trên cánh, mày màu kem dễ nhận, viền lông tam cấp. Gồm các loài chích nâu không sọc, cánh tròn, màu nâu, đuôi dài. Thích chui lủi sống: Từ rừng núi cao đến đồng bằng, và trong các làng bản.  Loài di cư, gặp phổ biến trong vùng phân bố đến độ cao khoảng 2.400 mét.', NULL, 'Từ vùng Đông Bắc đến hết Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4020, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopusmaculipennis', 'Phylloscopus maculipennis', 'Blyth, 1867', 'Chích mày xám', 'SPA_04055', ' 9cm. Chim trưởng thành: Họng và ngực trên xám trắng; bụng, lông bao dưới và trên đuôi vàng, vai mỗi cánh có hai vằn vàng, mép ngoài của lông đuôi trắng. Lông mày xám trắng. Các loại rừng.', NULL, 'Trung và Nam Trung Bộ, Tây Bắc. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(4021, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopusplumbeitarsus', 'Phylloscopus plumbeitarsus', 'Swinhoe, 1861            ', 'Chích mày lớn', 'SPA_04056', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4022, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopusproregulus', 'Phylloscopus proregulus', '(Pallas, 1811)            ', 'Chích hông vàng', 'SPA_04057', '10cm. Nhận dạng bởi phần trên thân màu xanh lá cây sáng, hông màu vàng, hai vằn cánh vàng nhạt, mày vàng nhạt, và sọc ở đỉnh đầu. Thường bay lượn lơ lửng. Hoạt động liên tục. Đôi khi tập trung thành đàn nhỏ Các vùng rừng khác nhau và cây bụi thứ sinh.  Loài di cư, sống trên độ cao khoảng 900-1.700 mét, ít khi gặp.', NULL, 'Bắc Bộ và Bắc Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(4023, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopusreguloides', 'Phylloscopus reguloides', '(Blyth, 1842).', 'Chích đuôi xám', 'SPA_04058', '12cm. Loài chích màu xanh lá cây xám, chuyên sống trên cây, có hai vằn cánh màu vàng, mảnh. Dải đỉnh đầu xanh nhạt, bao dưới đuôi vàng nhạt. Khi vẫy đuôi có thể nhìn thấy viền trắng của lông đuôi. Có tập tính bắt sâu trên thân cây và các cành cây giống như loài chim bạc má sống: Sống trên độ cao khoảng 1.200 mét trở lên, trong các vùng rừng thường xanh. Có các quần thể di cư và định cư. Thỉnh thoảng mới gặp.', NULL, 'Bắc Bộ và Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4024, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopusricketti', 'Phylloscopus ricketti', '(Slater, 1897)            ', 'Chích ngực vàng', 'SPA_04059', '11cm. Dễ nhận biết bởi phần dưới thân màu vàng sáng, có dải trên đầu nhưng không có vành mắt. Phần giữa bụng có thể nhạt màu hơn. Thường đi cùng với các loài chim chích khác trong rừng gỗ.  Sống ở độ cao khoảng 600-1.200 mét trong các vùng rừng.  Loài di cư, thỉnh thoảng mới gặp.', NULL, 'Từ Bắc Bộ đến phía Bắc đèo Hải Vân. Trước đây đã tìm thấy ở Lai Châu. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4025, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopusschwarzi', 'Phylloscopus schwarzi', '(Radde, 1863).', 'Chích bụng trắng', 'SPA_04060', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4026, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopussubaffinis', 'Phylloscopus subaffinis', '(Ogilivie-Grant, 1900)            ', 'Chích bụng hung', 'SPA_04061', '11cm. Phần bụng và họng màu da bò, lông mày trắng kéo dài tới sau gáy; không có vằn trên vai cánh, đuôi hơi tròn. Vùng cây bụi cỏ, thảm cỏ.  Loài di cư, phổ biến trong vùng phân bố.', NULL, 'Bắc Trung Bộ, Trung Trung Bộ, Bắc Bộ, trước đây đã thu mẫu ở Sa Pa, Lào Cai và Thanh Hóa. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(4027, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopustenellipes', 'Phylloscopus tenellipes', 'Swinhoe, 1860            ', 'Chim chích chân xám', 'SPA_04062', '13cm. Phía lưng có màu nâu ô liu (có thể có màu xanh lá cây nhạt), lông mày dài, cánh có một vằn trắng cánh rõ, có thể có vằn thứ hai mờ. Hông thường phớt hung nâu. Lông bao tai xanh nhạt, đỉnh đầu xám nhạt. Giống như Chích phương bắc nhưng mỏ nhỏ hơn, mỏ dưới màu hồng xám; chân dài có màu hồng nhạt. Các vùng rừng, kể cả rừng ngập mặn và trảng cây bụi thứ sinh. Kiếm ăn trong các bụi rậm. Loài di cư, khá phổ biến, có thể gặp đến độ cao khoảng 1.500 mét, mùa đông xuống thấp dưới 1.000 mét', NULL, 'Nam Bộ, đi qua Đông Bắc, Trung Bộ trên đường di cư ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(4028, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopustephrocephalus', 'Phylloscopus tephrocephalus', '(Anderson, 1871)', 'Chích đớp ruồi mày xám', 'SPA_04063', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4029, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopustrochiloides', 'Phylloscopus trochiloides', '(Sundevall, 1837)', 'Chích hai vạch', 'SPA_04064', '12cm. So với Chích phương bắc: Kích thước nhỏ hơn, thường là có vằn cánh thứ hai; lông bao tai trông mịn hơn; lông mày đậm, dài hơn và kéo tới gốc mỏ. Mỏ dưới màu vàng cam-hồng.  sống: Rừng thường xanh và vùng cây bụi thứ sinh ở vùng rừng núi lên tới độ cao khoảng 2.600 mét. Kiếm ăn ở tầng trung bình.  Loài di cư, có thể gặp lên tới độ cao khoảng 1.500m. Hiếm.', NULL, ' Chỉ mới tìm thấy ở Tây Bắc và Nam Bộ. Trước đây đã thu mẫu ở Yên Bái, Lai Châu và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4030, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Phylloscopus', NULL, 'GEN_1547', 'phylloscopusvalentini', 'Phylloscopus valentini', '(E. Hartert, 1907)', 'Chích đớp ruồi đầu xám', 'SPA_04065', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4031, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Pirina', NULL, 'GEN_1565', 'pirinainornata', 'Pirina inornata', '(Ogilvie-Grant, 1900)', 'Chiền chiện bụng hung', 'SPA_04066', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4032, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Seicercus', NULL, 'GEN_1802', 'seicercusburkii', 'Seicercus burkii', '(E. Burton, 1836)           ', 'Chích vàng mày đen', 'SPA_04067', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4033, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Seicercus', NULL, 'GEN_1802', 'seicercuscastaniceps', 'Seicercus castaniceps', 'Hodgson, 1845            ', 'Chích đầu hung', 'SPA_04068', '10cm. Không thể lẫn được vì chim nhỏ, màu sặc sỡ, và luôn hoạt động  Rừng thường xanh. Tìm thấy ở các trảng cây và bụi rậm xung quanh bìa rừng. Làm tổ ở vùng núi cao và chuyển xuống đai thấp vào mùa đông. Sống định cư, gặp ở độ cao khoảng 700-2.400 mét. Tương đối phổ biến.', NULL, 'Tây Bắc và Bắc Trung Bộ, Tây Nguyên. Trước đây đã thu mẫu ở vùng núi cao Nam Tây Nguyên, Sa Pa và Lào Cai. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(4034, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Seicercus', NULL, 'GEN_1802', 'seicercuspoliogenys', 'Seicercus poliogenys', '(Blyth, 1847). ', 'Chim đớp ruồi má xám', 'SPA_04069', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4035, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Seicercus', NULL, 'GEN_1802', 'seicercusvalentini', 'Seicercus valentini', 'E. Hartert, 1907', 'Chích bianchi', 'SPA_04070', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4036, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Tesia', NULL, 'GEN_1934', 'tesiacastaneocoronata', 'Tesia castaneocoronata', '(Burton, 1836)', 'Chích đuôi cụt bụng vàng', 'SPA_04071', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4037, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Tesia', NULL, 'GEN_1934', 'tesiacyaniventer', 'Tesia cyaniventer', '(Hodgson, 1837)', 'Chích đuôi cụt bụng xanh', 'SPA_04072', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4038, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Tesia', NULL, 'GEN_1934', 'tesiaolivea', 'Tesia olivea', '(McClelland, 1840)', 'Chích đuôi cụt', 'SPA_04073', 'mào vàng, trán, đầu, vai, lưng đến đuôi của chim trưởng thành phủ màu xanh ô liu, vàng sáng từ trán đến đầu; lông bay màu nâu sẫm, đầu ngoài màu nâu nhạt; hoa văn mắt đen; lông tai màu xám đen; cằm, họng, hai bên cổ và ngực, bụng gần như xám đá phiến nguyên chất, hơi nhạt hơn ở giữa bụng dưới, nhưng không xám như chim chích bụng xám; phủ nách, dưới và chân có màu xám đậm hơn; lông đuôi màu nâu sẫm, bề mặt lông đuôi ở giữa kết xuất màu xanh ô liu; phần đuôi che phủ màu xanh xám. [3] Mống mắt màu nâu; khóe miệng trên có màu nâu, đáy miệng dưới có màu đỏ cam hoặc vàng cam sẫm cho đến đầu miệng; các đốt sống lưng và ngón chân màu nâu, các móng vuốt màu nâu.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(4039, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Sylviidae', 'Chim Chích', 'FAM_358', 'Urosphena', NULL, 'GEN_2019', 'urosphenasquameiceps', 'Urosphena squameiceps', 'Swinhoe, 1863            ', 'Chích Á châu', 'SPA_04074', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4040, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Actinodura', NULL, 'GEN_0030', 'actinoduracyanouroptera', 'Actinodura cyanouroptera', '(Hodgson, 1838)', 'Khướu lùn cánh xanh', 'SPA_04075', '16cm. Đuôi và cánh màu xanh da trời, đỉnh đầu màu nhạt hơn. Lông bao cánh và nâu hung nhạt. Tiếng kêu : Có 3 hoặc 4 âm kéo dài và vang xa', NULL, 'Bắc Bộ và Nam Trung Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/bird/blue-winged-minla-167'),
(4041, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Actinodura', NULL, 'GEN_0030', 'actinoduraramsayt', 'Actinodura ramsayt', 'Walden, 1875', 'Khướu đuôi vằn vân nam', 'SPA_04076', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4042, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Actinodura', NULL, 'GEN_0030', 'actinodurasouliei', 'Actinodura souliei', 'Oustalet, 1897.', 'Khướu vằn gáy xanh', 'SPA_04077', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4043, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Alcippe', NULL, 'GEN_0058', 'alcippecastaneceps', 'Alcippe castaneceps', '(Hodgson, 1837)            ', 'Lách tách đầu đốm', 'SPA_04078', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4044, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Alcippe', NULL, 'GEN_0058', 'alcippechrysotis', 'Alcippe chrysotis', '(Blyth, 1845).', 'Lách tách ngực vàng', 'SPA_04079', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4045, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Alcippe', NULL, 'GEN_0058', 'alcippecinereiceps', 'Alcippe cinereiceps', '(J.Verreaux, 1870)', 'Lách tách họng vạch', 'SPA_04080', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4046, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Alcippe', NULL, 'GEN_0058', 'alcippedubia', 'Alcippe dubia', '(Hume, 1874)            ', 'Lách tách đầu nâu', 'SPA_04081', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4047, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Alcippe', NULL, 'GEN_0058', 'alcippegrotei', 'Alcippe grotei', 'Delacour, 1936.', 'Lách tách má nâu', 'SPA_04082', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4048, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Alcippe', NULL, 'GEN_0058', 'alcippemorrisonia', 'Alcippe morrisonia', '(Swinhoe, 1863)            ', 'Lách tách má xám', 'SPA_04083', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4049, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Alcippe', NULL, 'GEN_0058', 'alcippeperacensis', 'Alcippe peracensis', '(Sharpe, 1887). ', 'Lách tách vành mắt', 'SPA_04084', 'có lưng và đuôi màu nâu ấm, phần dưới màu trắng, mặt màu xám và vương miện màu xám phiến có viền bên dưới bằng một đường màu đen, nhưng con lông mày đen có hai bên sườn màu nâu và mắt trắng yếu hơn.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4050, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Alcippe', NULL, 'GEN_0058', 'alcippepoioicephala', 'Alcippe poioicephala', '(Jerdon, 1844)            ', 'Lách tách má nâu', 'SPA_04085', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4051, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Alcippe', NULL, 'GEN_0058', 'alcipperuficapilla', 'Alcippe ruficapilla', '(J.Verreaux, 1870).', 'Lách tách   ngực nâu', 'SPA_04086', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4052, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Alcippe', NULL, 'GEN_0058', 'alcipperufogularis', 'Alcippe rufogularis', '(Mandelli, 1873).', 'Lách tách đầu nâu', 'SPA_04087', 'Là một loài chim trong họ Pellorneidae. Nó có một hoa văn nổi bật với vương miện và kim tuyến xù xì, các sọc vương miện bên màu đen, màu trắng rộng tương phản với các tấm che tai màu nâu, họng và vú màu trắng, và có các cánh màu nâu đồng nhất.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(4053, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Alcippe', NULL, 'GEN_0058', 'alcippevinipectus', 'Alcippe vinipectus', '(Hodgson, 1837) ', 'Lách tách mày trắng', 'SPA_04088', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4054, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Chrysomma', NULL, 'GEN_0404', 'chrysommasinense', 'Chrysomma sinense', '(Gmelin, 1789)', 'Hoạ mi mỏ ngắn', 'SPA_04089', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4055, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Cyanoderma', NULL, 'GEN_0514', 'cyanodermachrysaea', 'Cyanoderma chrysaea', '(Blyth, 1844)', 'Khướu bụi vàng', 'SPA_04090', 'Nó có đôi cánh màu xanh ô liu và phần dưới màu vàng. Vương miện và gáy của nó có màu vàng vàng với các sọc hẹp. Nó dài 19–12 cm (7,5–4,7 in) và nặng 6–10 g (0,21–0,35 oz). ', NULL, 'Nó xuất hiện từ chân đồi phía đông dãy Himalaya đến Đông Nam Á và sinh sống ở các khu rừng vùng đất thấp và vùng núi cận nhiệt đới', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Golden_babbler'),
(4056, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Dryonastes', NULL, 'GEN_0614', 'dryonasteschinensis', 'Dryonastes chinensis', '(Scopoli , 1786)', 'Khướu bạc má', 'SPA_04091', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4057, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Erpornis', NULL, 'GEN_0672', 'erporniszantholeuca', 'Erpornis zantholeuca', '(Blyth, 1844)            ', 'Khướu mào bụng trắng', 'SPA_04092', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4058, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Erythrogenys', NULL, 'GEN_0674', 'erythrogenyshypoleucos', 'Erythrogenys hypoleucos', '(Blyth, 1844)            ', 'Hoạ mi đất mỏ dài', 'SPA_04093', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4059, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Gampsorhynchus', NULL, 'GEN_0734', 'gampsorhynchusrufulus', 'Gampsorhynchus rufulus', 'Blyth,1844             ', 'Khướu đuôi dài', 'SPA_04094', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4060, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Gampsorhynchus', NULL, 'GEN_0734', 'gampsorhynchustorquatus', 'Gampsorhynchus torquatus', '(Rasmussen & Anderton, 2005)', 'Khướu đuôi dài', 'SPA_04095', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4061, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxaffinis', 'Garrulax affinis', '(Blyth, 1843)', 'Khướu mặt đen', 'SPA_04096', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4062, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxalbogularis', 'Garrulax albogularis', '(Gould, 1836)', 'Khướu họng trắng', 'SPA_04097', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4063, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxcanorus', 'Garrulax canorus', '(Linnaeus, 1758)            ', 'Họa Mi', 'SPA_04098', '25cm. Màu nâu, vành mắt màu trắng kéo dài ra phía sau Sống ở vùng cây bụi, chỗ rậm rạp ven chân đồi và cạnh các khu vực nương rẫy', NULL, ' Bắc Bộ và Bắc Trung Bộ ', NULL, NULL, 'Có giá trị khoa học và thẩm mỹ. Tiếng hót hay. Là đối tượng nghiên cứu khoa học và giúp cân bằng sinh thái trong tự nhiên', NULL, NULL, NULL, 'VnCreature'),
(4064, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxcastanotis', 'Garrulax castanotis', '(Ogilvie-Grant, 1899)', 'Khướu má hung', 'SPA_04099', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4065, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxchinensis', 'Garrulax chinensis', '(Scopoli, 1786)            ', 'Khướu bạc má', 'SPA_04100', ' 27cm. Khi bay nhìn xa có màu đen, má trắng nổi bật sống: Trong tầng cây bụi thứ sinh, chỗ cỏ cây rậm rạp và tre nứa dưới tán rừng, những nơi có độ cao khoảng dưới 1.200 mét. Đi thành đàn nhỏ.', NULL, ' Tất cả các vùng. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4066, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxerythrocephalus', 'Garrulax erythrocephalus', '(Vigors, 1832)            ', 'Khướu đầu hung', 'SPA_04101', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4067, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxformosus', 'Garrulax formosus', 'Delacour et Jabouille, 1930', 'Khướu cánh đỏ', 'SPA_04102', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4068, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxgularis', 'Garrulax gularis', '(McClelland, 1840)', 'Khướu họng vàng', 'SPA_04103', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4069, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxleucolophus', 'Garrulax leucolophus', '(Hardwicke, 1815)            ', 'Khướu đầu trắng', 'SPA_04104', 'Chim trưởng thành: Lông mào dài ở đầu, đỉnh đầu và mặt bụng trắng tinh. Gáy và hai bên cổ Xám. Trước mắt, trước trán và một dãi rộng kéo ngangqua tai đen. Hai bên sườn nâu hung. Phần còn lại của bộ lông nâu vớ phần lưng phớt hung đỏ và đuôi xám nâu đen. Mắt nâu hay nâu đỏ. Mỏ đen. Chân xám thẫm. Kích thước: Cánh: 120 - 146; đuôi: 115 - 138; giò: 38 - 48; mỏ: 25 - 30 mm. ', NULL, 'Việt Nam Khướu đầu trắng khá phổ biến ở tất cả các vùng rừng núi từ Bắc đến Nam. Nam Trung quốc và Đông Dương', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4070, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxlugubris', 'Garrulax lugubris', '(Müller, 1835)', 'Khướu đen', 'SPA_04105', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4071, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxmaesi', 'Garrulax maesi', '(Oustalet, 1890)', 'Khướu xám', 'SPA_04106', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4072, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxmerulinus', 'Garrulax merulinus annammensis', '(Blyth, 1851)', 'Khướu ngực đốm ', 'SPA_04107', 'Đặc điểm nhận dạng:\n\nChim có bộ lông màu nâu. Ngực có các vệt hay đốm hình bầu dục hẹp, màu đen. Theo Robson (2000), Khướu ngực đốm phân bố ở Đông Bắc Lào và Tây Bắc Việt Nam thuộc phân loài Garrulax merulina obscurus, có các đốm màu đen to ở ngực và họng, lông mày không có màu vàng cam hung, nhìn thấy rõ ràng, còn phân loài Garrulax merulina annamensis (Delacour et al. 1931; Võ Quý, 1981), hay được coi là một loài đặc hữu Garrulax merulina annamensis (Robson, 2000), phân bố ở vùng Nam Trung Bộ Việt Nam, có họng màu đen, các đốm đen chỉ có ở ngực và nằm trên nền lông có màu vàng cam hung kéo dài từ ngực đến dưới đuôi. Lông mày cùng màu nhưng nhìn nhạt hơn.\n\nSinh học, sinh thái:\n\nSống ở rừng thường xanh cây lá rộng, rừng thứ sinh, rừng tre vầu và ở cửa rừng. Kiếm ăn gần mặt đất, chỗ ít rậm rạp. Có thể gặp lên đến độ cao 1.500 - 2.000m., đi lẻ hay đôi. Có tiếng hót rất véo von. Làm tổ ở bụi rậm, gần mặt đất. Thời gian làm tổ khoảng từ tháng 4 - 7. Đẻ 2 - 3 trứng.', NULL, 'Trong nước: Tây Bắc, Bắc và Nam Trung Bộ: Lai Châu, Lào Cai, Nghệ An, Đắk Lắk và Lâm Đồng.\n\nThế giới: Ấn Độ, Mianma , Thái Lan, Trung Quốc, Lào.', NULL, NULL, 'Nguồn gen quý. Hót hay, bị bắt để nuôi làm chim cảnh.', 'LR', NULL, NULL, NULL),
(4073, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxmilleti', 'Garrulax milleti', 'Robinson & Kloss, 1919', 'Khướu đầu đen', 'SPA_04108', '30cm. Chim trưởng thành đầu, họng và phần trên ngực màu đen; mào lông ngắn; miếng da trần sau mắt xanh da trời; ngực, hai bên cổ và sau cổ có dải màu trắng. Mỏ đen.', NULL, 'Khu vực rừng núi cao Tây Nguyên. Đã ghi nhận ở các tỉnh: Quảng Nam (Ngọc Linh), Kon Tum (Ngọc Linh), Gia Lai (Khu bảo tồn Kon Ka Kinh, Kon Cha Răng), Đak Lak (Chư Yang Sin), Lâm Đồng (Lạc Dương, Di Linh). Độ cao phân bố từ 900-1.500m.', NULL, ' Loài đặc hữu của Việt Nam', NULL, NULL, NULL, NULL, NULL),
(4074, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxmilnei', 'Garrulax milnei', '(David, 1874).', 'Khướu đuôi đỏ', 'SPA_04109', 'Chim trưởng thành trán, đỉnh đầu và tai đen phớt xám nhạt. Đuôi vá cánh thẫm. Cằm và họng đen nhạt. Phần còn lại của bộ lông nâu vàng lục có vằn nâu thẫm chuyển thành xám lục nhạt ở lưng dưới, hông, bụng trên và dưới đuôi.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(4075, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxmonileger', 'Garrulax monileger', 'Hodgson, 1836            ', 'Khướu khoang cổ', 'SPA_04110', '26,5-31,5cm. Khác Khướu kiếm đen ở kích thước nhỏ hơn, có khoảng đen kết nối từ mắt qua má vòng vào xung quanh kích thước. Má, trắng không có sọc. sống: Các vùng rừng khác nhau có thể đạt đến độ cao gần 1.700 mét.', NULL, 'Các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4076, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxpectoralis', 'Garrulax pectoralis', '(Gould, 1836). ', 'Khướu ngực đen', 'SPA_04111', '33cm. Đầu có họa tiết nổi bật, phần lưng màu hung tươi, đuôi màu nâu sẫm. Phân loài Picticollis ở Nam Trung Quốc có các mảng xanh da trời-xám hai bên cổ, nhưng một số phân loài khác lại có khoang cổ màu đen. Tiếng kêu: Ngân vang, rất có giai điệu.', NULL, ' Bắc Bộ. Chỉ mới thu mẫu ở Tam Đảo trước đây.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(4077, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxperspicillatus', 'Garrulax perspicillatus', '(Gmelin, 1789)', 'Bò chao, Liếu điếu', 'SPA_04112', '30cm. Dễ dàng được nhận biết bởi có mặt nạ rộng rãi. Thường tập trung thành đàn nhỏ và động.  sống: Chỗ có cây bụi nước suối, tre nứa và lau rau. Sống chung với các biến phổ khác ở các địa hình thấp.', NULL, 'Từ Bắc Bộ đến Trung Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4078, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxsannio', 'Garrulax sannio', 'Swinhoe, 1867            ', 'Bồ chiêu', 'SPA_04113', 'Lông mày và vùng tai màu trắng, đuôi hung, bao dưới đuôi nâu vàng nhạt. Lông đỉnh đầu có thể dựng lên giống như mào. Tiếng kêu: Hót với giai điệu ‘pi-ou pi-ou’ to. ', NULL, 'Bắc Bộ và Bắc Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(4079, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxsubunicolor', 'Garrulax subunicolor', 'Blyth, 1843', 'Khướu vằn', 'SPA_04114', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4080, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Garrulax', NULL, 'GEN_0738', 'garrulaxvassali', 'Garrulax vassali', '(Ogilvie-Grant , 1906)', 'Khướu đầu xám', 'SPA_04115', 'Chim trưởng thành trán, tai và cằm đen, má trắng. Đỉnh đầu và sau cổ xám thẫm. Phía trên có màu nâu đến nâu hung. Cuối đuôi có dải đen rộng và tận cùng là dải trắng (trừ đôi lông đuôi ở giữa). Họng và ngực xám, sườn hung nâu. Giữa bụng màu nhạt dần và chuyển sang trắng ở giữa đuôi. Mắt hung nâu. Mỏ đen nhạt, mỏ dưới trắng đục. Chân xám thẫm.\n\nSinh học:\n\nChim non rời tổ vào nửa đầu tháng 6 (gặp ở Thừa Thiên - Huế)\n\nNơi sống và sinh thái:\n\nSống định cư và làm tổ ở rừng nguyên sinh, thứ sinh và rừng khai thác, trên độ cao khoảng 500m trở lên. Thường kiếm ăn trên mặt đất, nơi có nhiều cây bụi, dây leo ở trong rừng, vùng cửa rừng và cả ở nương rẫy. Ngoài mùa sinh sản thường gặp đàn đông tới vài chục con.', NULL, 'Việt Nam: Trung bộ từ Quảng Trị, Thừa Thiên - Huế, Khánh Hòa, Gia Lai, Kom Tum, Đắc Lắc đến Lâm Đồng.\n\nThế giới: Trung và Nam Lào.', NULL, NULL, 'Dạng đặc sản ở Việt Nam và Đông Dương. Có giá trị khoa học và thẩm mỹ', 'T', NULL, NULL, NULL),
(4081, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Heterophasia', NULL, 'GEN_0876', 'heterophasiadesgodinsi', 'Heterophasia desgodinsi', '(Blyth, 1859).', 'Mi đầu đen ', 'SPA_04116', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4082, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Heterophasia', NULL, 'GEN_0876', 'heterophasiagracilis', 'Heterophasia gracilis', '(Horsfield, 1840). ', 'Mi xám', 'SPA_04117', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4083, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Heterophasia', NULL, 'GEN_0876', 'heterophasiamelanoleuca', 'Heterophasia melanoleuca', '(Blyth, 1859)', 'Mi đầu đen', 'SPA_04118', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4084, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Heterophasia', NULL, 'GEN_0876', 'heterophasiapicaoides', 'Heterophasia picaoides', '(Hodgson, 1839)', 'Mi đuôi dài', 'SPA_04119', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4085, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Jabouilleia', NULL, 'GEN_0983', 'jabouilleiadanjoui', 'Jabouilleia danjioui', NULL, 'Khướu mỏ dài', 'SPA_04120', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4086, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Leiathrix', NULL, 'GEN_1040', 'leiathrixargentauris', 'Leiathrix argentauris', 'Hodgson, 1838', 'Kim oanh tai bạc', 'SPA_04121', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4087, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Leiothrix', NULL, 'GEN_1044', 'leiothrixargentauris', 'Leiothrix argentauris', '(Hodgson, 1837)            ', 'Kim oanh tai bạc', 'SPA_04122', '18cm. Đầu đen, tai bạc, mỏ vàng. Chim mái có gốc đuôi màu đỏ thay cho màu da cam xỉn. Tiếng kêu: Có tiếng kêu và hót với nhiều nhịp điệu.', NULL, 'Bắc Bộ, Bắc và Nam Trung Bộ. Đã thu mẫu ở nhiều nơi.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4088, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Leiothrix', NULL, 'GEN_1044', 'leiothrixlutea', 'Leiothrix lutea', '(Scopoli, 1786)', 'Kim oanh mỏ đỏ', 'SPA_04123', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4089, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Leiothrix', NULL, 'GEN_1044', 'leiothrixphoenicea', 'Leiothrix phoenicea', '(Gould 1837).', 'Kim oanh mặt đỏ', 'SPA_04124', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4090, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Liocichla', NULL, 'GEN_1087', 'liocichlaripponi', 'Liocichla ripponi', '(Oates, 1900)', 'Khướu mặt đỏ', 'SPA_04125', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4091, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Macronous', NULL, 'GEN_1145', 'macronousgularis', 'Macronous gularis', '(Horsfield, 1822)            ', 'Chích chạch má vàng', 'SPA_04126', 'Chích chạch má vàng là chim chích nhỏ (khoảng 12cm) với mỏ cứng khỏe. Thân trên của chim màu nâu với đỉnh đầu màu nâu đậm và một sọc vàng trên mắt. Thân dưới màu vàng nhạt với sọc đen nhỏ trước ngực. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Hệ thống thông tin, cơ sở dữ liệu môi trường tỉnh Bắc Kạn '),
(4092, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Macronous', NULL, 'GEN_1145', 'macronouskelleyi', 'Macronous kelleyi', '(Delacour, 1932)            ', 'Chích chạch má xám', 'SPA_04127', ' 14cm. Hình thái rất giống loài Chích chạch má vàng nhưng bộ lông nhìn chung nhạt màu hơn; đặc biệt hai bên má màu xám; các vạch ở phần dưới cơ thể mảnh hơn. Rừng thường xanh và rừng thứ sinh.  Loài định cư. Đặc hữu của Việt Nam và Lào, tương đối phổ biến.', NULL, 'Vùng Trung và Nam Trung Bộ, ở độ cao thấp ', NULL, NULL, NULL, NULL, NULL, NULL, 'Birdwatchingvietnam'),
(4093, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Macronous', NULL, 'GEN_1145', 'macronuspalustris', 'Macronus palustris', 'Horsfield, 1821', 'Chích chạch má vàng', 'SPA_04128', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4094, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Malacopteron', NULL, 'GEN_1154', 'malacopteroncinereum', 'Malacopteron cinereum', 'Eyton, 1839            ', 'Chuối tiêu đuôi ngắn', 'SPA_04129', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4095, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Minla', NULL, 'GEN_1235', 'minlacyanouroptera', 'Minla cyanouroptera', '(Hodgson, 1837)            ', 'Khướu lùn cánh xanh', 'SPA_04130', ' Chim trưởng thành công:\nTrán, đỉnh dâu, gáy và trên cổ xám xanh nhạt, hai bên đầu xanh hơn, lông mày và phía trước có vạch đen. Trước mắt, xung quanh mắt và dải rộng sau mắt trắng. Phần còn lại của mặt sau hung vàng nhạt. Lông cánh đen viền xanh, các loại lông cánh thứ cấp trong cùng và lông cánh tam cấp viền xám nhạt.\nLông rừng xám viền xanh với lông đen, hai đôi lông đuôi ngoài càng có dưỡng lông trắng. Mặt bụng hung trắng nhạt. Mắt nâu hay xám. Mỏ xám góc. Chân Nâu Hồng Sủng.\nKích thước: Cánh: 62 - 70; lứa: 63 - 70; giò: 25; Moi: 12 - 13mm. ', NULL, 'ở Lào Cai, Lai Châu và Thanh Hóa ở những nơi cao trên 1.000m.  phân bố ở Bắc Thái Lan, Tây Nam Trung Quốc (Vân Nam) và Bắc Đông Dương.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4096, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Minla', NULL, 'GEN_1235', 'minlaignotincta', 'Minla ignotincta', 'Hodgson, 1837', 'Khướu lùn đuôi đỏ', 'SPA_04131', '14cm. Trên đầu màu đen, dải lông mày màu trắng kéo dài từ gốc mỏ ra sau gáy, đuôi đen “viền” màu và một vệt màu đỏ tương tự trên cánh, nhưng ở chim cái và chim non vệt này lại có màu vàng nhạt và viền đuôi hồng nhạt. Tiếng kêu: Tiếng hót có 4 nốt, vọng xa.', NULL, 'Tây Bắc và Tây Nguyên. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(4097, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Minla', NULL, 'GEN_1235', 'minlastrigula', 'Minla strigula', '(Hodgson, 1837)', 'Khướu lùn đuôi hung', 'SPA_04132', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4098, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Mixornis', NULL, 'GEN_1240', 'mixornisgularis', 'Mixornis gularis', '(Vieillot, LJP 1818).', 'Chích chạch má vàng', 'SPA_04133', 'Chích chạch má vàng là chim chích nhỏ (khoảng 12cm) với mỏ cứng khỏe. Thân trên của chim màu nâu với đỉnh đầu màu nâu đậm và một sọc vàng trên mắt. Thân dưới màu vàng nhạt với sọc đen nhỏ trước ngực. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnamwildlife'),
(4099, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Mixornis', NULL, 'GEN_1240', 'mixorniskelleyi', 'Mixornis kelleyi', 'Delacour, 1932.', 'Chích chạch má xám', 'SPA_04134', '14cm. Hình thái rất giống loài Chích chạch má vàng nhưng bộ lông nhìn chung nhạt màu hơn; đặc biệt hai bên má màu xám; các vạch ở phần dưới cơ thể mảnh hơn.  Rừng thường xanh và rừng thứ sinh.  Loài định cư, tương đối phổ biến.', NULL, 'Vùng Trung và Nam Trung Bộ, ở độ cao thấp. ', NULL, ' Đặc hữu của Việt Nam và Lào', NULL, NULL, NULL, NULL, 'Birdwatchingvietnam'),
(4100, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Napothera', NULL, 'GEN_1289', 'napotherabrevicaudata', 'Napothera brevicaudata', '(Blyth, 1855)            ', 'Khướu đá đuôi trắng', 'SPA_04135', 'Thân trên có màu nâu ô liu xám, các lông ở đỉnh và sau có màu xám ở giữa, mép ngoài màu nâu sẫm, mép ngoài cùng màu đen, tạo thành các đốm có vảy rõ ràng trên đỉnh và sau đầu. Các tấm phủ ở eo và đuôi có màu nâu ô liu, đuôi ngắn và màu nâu đỏ sẫm, cánh màu nâu ô liu, các tấm phủ lớn trên cánh và các lông bay bên trong có các đốm trắng nhỏ ở đầu tận cùng, tạo thành các đốm trắng xếp thành hàng. trên đôi cánh. Mặt trước của mắt, đường chân mày ngắn, mặt dưới mắt và vành tai nói chung có màu xám đen, với một chút màu nâu trên vành tai. Cằm và họng màu trắng xám với các sọc dọc màu nâu sẫm, ngực và bụng màu nâu sẫm hoặc da màu nâu vàng, hai bên sườn, các tấm phủ quanh hậu môn và dưới đuôi có màu sẫm và nâu sẫm. [1] Mống mắt có màu đỏ hoặc đỏ quế, góc trên của miệng màu nâu, miệng dưới màu xám nhạt hơn, bàn chân và các ngón chân có màu nâu xám', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan.gov.vn'),
(4101, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Napothera', NULL, 'GEN_1289', 'napotheracrispifrons', 'Napothera crispifrons', 'Blyth, 1855', 'Khướu đá hoa', 'SPA_04136', 'Khướu đá hoa là chim có kích thước trung bình trong họ chuối tiêu (khoảng 20 cm). Chim có màu chủ đạo nâu xám với nhiều lông trắng trên phần thân trên (từ đỉnh đầu đến phần lưng trên), nhiều màu đậm đến đậm màu trên cổ màu trắng và phần phân dưới nâu nhạt. Chim có đuôi tương phản dài. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnamwildlife'),
(4102, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Napothera', NULL, 'GEN_1289', 'napotheraepilepidota', 'Napothera epilepidota', '(Temminck, 1827)            ', 'Khướu đá nhỏ', 'SPA_04137', 'Khướu đá nhỏ là loài có kích thước rất nhỏ trong họ chuối tiêu (khoảng 10 cm). Chim có bộ lông phần lớn màu nâu với lông mày trắng nhạt dài, sọc ngang mắt đen đậm, cổ trắng và nhiều điểm trắng trên cánh. Chim trống và mái giống nhau. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4103, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Paradoxornis', NULL, 'GEN_1446', 'paradoxornisdavidianus', 'Paradoxornis davidanus', 'H. H. Slater, 1897', 'Khướu mỏ dẹt đuôi ngắn', 'SPA_04138', '9cm. Kích thước nhỏ, mỏ vẹt, đầu có màu hung tươi tương phản với màu xám tối ở lưng, và xám nhạt ở ngực.', NULL, 'Bắc Bộ và Bắc Trung Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(4104, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Paradoxornis', NULL, 'GEN_1446', 'paradoxornisgularis', 'Paradoxornis gularis', 'Gray, 1845', 'Khướu mỏ dẹt đầu xám', 'SPA_04139', '18cm. Họa tiết trên đầu dễ nhận biết, mỏ vẹt màu vàng cam. Tiếng kêu: Tiếng gọi đàn hai âm kép được nối tiếp bằng tiếng ‘pai-ou’. Luôn nghe tiếng kêu líu ríu huyên náo.', NULL, 'Tây Bắc, Nam Trung Bộ và Cao Nguyên Kon Tum', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4105, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Paradoxornis', NULL, 'GEN_1446', 'paradoxornisguttaticollis', 'Paradoxornis guttaticollis', '(David, 1871).', 'Khướu mỏ dẹt ngực đốm', 'SPA_04140', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4106, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Paradoxornis', NULL, 'GEN_1446', 'paradoxornisnipalensis', 'Paradoxornis nipalensis', '(Hodgson, 1837)', 'Khướu mỏ dẹt bụng đen', 'SPA_04141', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4107, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Paradoxornis', NULL, 'GEN_1446', 'paradoxornisruficeps', 'Paradoxornis ruficeps', '(Blyth, 1842)            ', 'Khướu mỏ dẹt to', 'SPA_04142', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4108, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Paradoxornis', NULL, 'GEN_1446', 'paradoxorniswebbianus', 'Paradoxornis webbianus', '(Gould, 1852)', 'Khướu mỏ dẹt bé', 'SPA_04143', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4109, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Pellorneum', NULL, 'GEN_1493', 'pellorneumalbiventre', 'Pellorneum albiventre', '(Godwin-Austen, 1877)            ', 'Chuối tiêu họng đốm', 'SPA_04144', 'Bộ lông đực cũng tương tự. Phần trên cơ thể có màu nâu ô liu từ đầu đến đuôi bao gồm cả hai cánh. Cánh và đuôi có nhiều màu đỏ hơn. Phía trước và phía trên của mắt có màu nâu xám, bao tai màu nâu với bút lông màu sáng, cổ và lưng có cùng màu. Cằm và cổ họng màu trắng với những đốm đen sì, ngực màu nâu ô liu nhạt tạo thành một bao ngực rộng, giữa bụng màu trắng, hai bên sườn và phần còn lại của phần dưới có màu đỏ gỉ. Tròng mắt có màu đỏ cam. Các góc trên của miệng có màu nâu. Miệng dưới nhẹ hơn, và bàn chân nhẹ hơn. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'UBND tinh Bac Kan'),
(4110, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Pellorneum', NULL, 'GEN_1493', 'pellorneumruficeps', 'Pellorneum ruficeps', '(Swainson, 1832)            ', 'Chuối tiêu ngực đốm', 'SPA_04145', 'Chuối tiêu ngực đốm là loài chim có kích thước trung bình (khoảng 16 cm) trong nhóm chuối tiêu. Chim trống và mái giống nhau. Chim có đỉnh đầu màu hạt dẻ, mày dài trắng, thân trên (bao gồm cả phần trên của đuôi) màu nâu nhạt và có nhiều sọc lớn nổi bật trên ngực và sườn trắng. Chim có mỏ và chân rất khỏe.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4111, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Pellorneum', NULL, 'GEN_1493', 'pellorneumtickelli', 'Pellorneum tickelli', '(Blyth, 1859)            ', 'Chuối tiêu đất', 'SPA_04146', 'Chuối tiêu đất là một loài có kích thước nhỏ (khoảng 14 cm) trong họ chuối tiêu. Chim có thân trên nâu đỏ, thân dưới nâu vàng với bụng trắng. Con trống và con mái giống nhau.Việt Nam có hai phân loài, phân loài phía Bắc không có mảng xám quanh mắt ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'vietnamwildlife'),
(4112, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Pnoepyga', NULL, 'GEN_1594', 'pnoepygaalbiventer', 'Pnoepyga albiventer', '(Hodgson, 1837)', 'Khướu đất đuôi dài', 'SPA_04147', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4113, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Pnoepyga', NULL, 'GEN_1594', 'pnoepygapusilla', 'Pnoepyga pusilla', 'Hodgson, 1845', 'Khướu đất đuôi cụt lùn', 'SPA_04148', '9cm. Nhỏ, cụt đuôi. Sống lẩn lút. Phía lưng màu nâu, mặt bụng màu nhạt hơn và có dạng vẩy. Đi lẻ. Nhận biết bởi tiếng huýt 2 nốt ‘si-sô’, to, kéo dài, lặp lại mãi.', NULL, 'Tây Bắc, Bắc và Nam Trung Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(4114, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Pomatorhinus', NULL, 'GEN_1608', 'pomatorhinuserythrocnemis', 'Pomatorhinus erythrocnemis', 'Gould, 1863', 'Hoạ mi đất ngực đốm', 'SPA_04149', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4115, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Pomatorhinus', NULL, 'GEN_1608', 'pomatorhinuserythrogenys', 'Pomatorhinus erythrogenys', 'Vigors, 1832            ', 'Họa mi đất má trắng', 'SPA_04150', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4116, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Pomatorhinus', NULL, 'GEN_1608', 'pomatorhinusferruginosus', 'Pomatorhinus ferruginosus', 'Blyth, 1845            ', 'Hoạ mi đất ngực hung', 'SPA_04151', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4117, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Pomatorhinus', NULL, 'GEN_1608', 'pomatorhinushypoleucos', 'Pomatorhinus hypoleucos', '(Blyth, 1844)            ', 'Họa mi đất mỏ dài ', 'SPA_04152', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4118, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Pomatorhinus', NULL, 'GEN_1608', 'pomatorhinusochraceiceps', 'Pomatorhinus ochraceiceps', 'Walden, 1873            ', 'Hoạ mi đất mỏ đỏ', 'SPA_04153', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4119, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Pomatorhinus', NULL, 'GEN_1608', 'pomatorhinusruficollis', 'Pomatorhinus ruficollis', 'Hodgson, 1836            ', 'Họa mi đất ngực luốc', 'SPA_04155', ' Đặc điểm nổi bật là lông mày trắng, gáy hung, ngực có vạch đậm, mỏ vàng và hơi quặp xuống.  Rừng thường xanh, trong vùng tre nứa và cây bụi dưới tán rừng. Thường kiếm ăn trong các bụi cây rậm. Sống định cư, gặp ở độ cao khoảng từ 900-2.400 mét. Hay đi thành đàn nhỏ, ít gặp.', NULL, 'Bắc Bộ và Bắc Trung Bộ. Trước đây đã thu được vật mẫu ở nhiều nơi. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(4120, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Pomatorhinus', NULL, 'GEN_1608', 'pomatorhinusschisticeps', 'Pomatorhinus schisticeps', '(Hodgson, 1836). ', 'Hoạ mi đất mày trắng', 'SPA_04156', '17cm. Chim trống: Có đầu đen với dải trắng sau mắt và mảng màu vàng sẫm ở phần lông tam cấp. Chim mái: Toàn bộ đầu và mặt lưng nhìn chung có màu xám. Cả hai đều có mặt bụng màu trắng sống: Rừng thường xanh kể cả rừng thưa.  Sống định cư, gặp ở độ cao trên khoảng 900 mét, tương đối phổ biến.', NULL, 'Bắc Bộ, Bắc và Nam Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4121, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Psittiparus', NULL, 'GEN_1671', 'psittiparusgularis', 'Psittiparus gularis', 'Gray, 1845', 'Khướu mỏ dẹt đầu xám*', 'SPA_04157', '18cm. Họa tiết trên đầu dễ nhận biết, mỏ vẹt màu vàng cam. Rừng thường xanh, bụi rậm và cây bụi thứ sinh. Sinh sản ở vùng núi cao, di chuyển xuống đai thấp vào mùa đông.  Sống định cư ở độ cao khoảng từ 600-900 mét, tương đối phổ biến.', NULL, 'Tây Bắc, Nam Trung Bộ và Cao Nguyên Kon Tum ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(4122, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Pteruthius', NULL, 'GEN_1682', 'pteruthiusaenobarbus', 'Pteruthius aenobarbus', '(Temminck, 1835)', 'Khướu mỏ quặp cánh vàng', 'SPA_04158', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
