(4127, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Stachyris', NULL, 'GEN_1854', 'stachyrisnigriceps', 'Stachyris nigriceps', '(Blyth, 1847)            ', 'Khướu bụi đầu đen', 'SPA_04163', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4128, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Stachyris', NULL, 'GEN_1854', 'stachyrisruficeps', 'Stachyris ruficeps', 'Blyth, 1847', 'Khướu bụi đầu hung', 'SPA_04164', '12cm. Đỉnh đầu có vạch màu nâu đỏ, họng vàng nhạt có vạch xám. sống: Rừng, vùng cây bụi và tre nứa, đi theo đàn hỗn hợp.  Sống định cư, gặp ở độ cao trên khoảng 900 mét. Không phổ biến.', NULL, 'Bắc Bộ và Trung Bộ. Trước đây đã thu mẫu ở các vùng núi cao phía Bắc và vùng Cao nguyên Nam Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4129, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Stachyris', NULL, 'GEN_1854', 'stachyrisrufifrons', 'Stachyris rufifrons', 'Hume, 1873            ', 'Khướu bụi trán hung', 'SPA_04165', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4130, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Stachyris', NULL, 'GEN_1854', 'stachyrisstriolata', 'Stachyris striolata', '(Müller, 1835)            ', 'Khướu bụi đốm cổ', 'SPA_04166', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4131, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Timalia', NULL, 'GEN_1962', 'timaliapileata', 'Timalia pileata', '(Horsfield, 1821)            ', 'Họa Mi Nhỏ', 'SPA_04167', '18cm. Màu sắc đẹp, đỉnh đầu màu hung tươi, ngực có sọc mịn, lông đuôi xếp thành nhiều cấp Sống ở rừng tre nứa, vùng cỏ tranh lau lách rậm rạp và cây bụi thứ sinh. Ngoài mùa sinh sản có thể gặp đi cùng một số loài khác. Tiếng kêu: Có tiếng hót đa dạng', NULL, 'Khắp các vùng trong cả nước ', NULL, NULL, 'Có giá trị khoa học và thẩm mỹ. Tiếng hót hay. Là đối tượng nghiên cứu khoa học và giúp cân bằng sinh thái trong tự nhiên', NULL, NULL, NULL, 'Birth of South East Asia'),
