(4136, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Yuhina', NULL, 'GEN_2065', 'yuhinadiademata', 'Yuhina diademata', '(Verreaux, 1869)', 'Khướu mào cổ trắng', 'SPA_04172', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4137, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Yuhina', NULL, 'GEN_2065', 'yuhinaflavicollis', 'Yuhina flavicollis', '(Hodgson, 1836)            ', 'Khướu mào cổ hung', 'SPA_04173', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4138, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Yuhina', NULL, 'GEN_2065', 'yuhinagularis', 'Yuhina gularis', '(Hodgson, 1836)            ', 'Khướu mào họng đốm', 'SPA_04174', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4139, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Yuhina', NULL, 'GEN_2065', 'yuhinanigrimenta', 'Yuhina nigrimenta', '(Blyth, 1845)            ', 'Khướu mào đầu đen', 'SPA_04175', '12cm. Có mào đen nhạt, mỏ đỏ, chân vàng-da cam. Tiếng kêu: Tiếng hót chin chit.', NULL, 'Bắc Bộ, Bắc và Nam Trung Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(4140, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Timaliidae', 'Khướu', 'FAM_375', 'Yuhina', NULL, 'GEN_2065', 'yuhinazantholeuca', 'Yuhina zantholeuca', '(Blyth, 1844)            ', 'Khướu mào bụng trắng', 'SPA_04176', ' 13cm. Mặt lưng màu lục phớt vàng, mắt đen, bao dưới đuôi vàng. Trông giống như chim chích. Thường sống ở tầng giữa của rừng và kiếm ăn theo đàn chim hỗn hợp. Hay đậu chổng ngược, có tập tính giống loài chim Bạc má. sống: Rừng thường xanh, rừng hỗn giao rụng lá và cây bụi thứ sinh.  Sống định cư, gặp phổ biến lên đến độ cao khoảng 2.000 mét, đi theo đàn nhỏ và kiếm ăn theo đàn hỗn hợp. Làm tổ từ tháng 2-6.', NULL, 'Khắp các vùng. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4141, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Brachypteryx', NULL, 'GEN_0244', 'brachypteryxleucophrys', 'Brachypteryx leucophris', '(Temminck, 1828)', 'Hoét đuôi cụt bụng trắng', 'SPA_04177', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4142, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Brachypteryx', NULL, 'GEN_0244', 'brachypteryxmontana', 'Brachypteryx montana', 'Horsfield, 1821', 'Hoét', 'SPA_04178', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4143, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Brachypteryx', NULL, 'GEN_0244', 'brachypteryxstellata', 'Brachypteryx stellata', '(Gould, 1868)', 'Hoét đuôi cụt bụng vằn', 'SPA_04179', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4144, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Cinclidium', NULL, 'GEN_0411', 'cinclidiumfrontale', 'Cinclidium frontale', '(Blyth, 1842).', 'Oanh mày xanh', 'SPA_04180', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4145, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Cinclidium', NULL, 'GEN_0411', 'cinclidiumleucurum', 'Cinclidium leucurum', '(Hodgson, 1845). ', 'Oanh đuôi trắng', 'SPA_04181', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4146, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Cinclidium', NULL, 'GEN_0411', 'cinclidiumsundra', 'Cincilidium sundra', NULL, 'Oanh đuôi trắng', 'SPA_04182', 'Chim trống: Dễ nhận dạng. Màu xanh đen, hai dải trắng dọc trên đuôi. Chim mái: Nhìn chung có màu nâu xám, một dải ở họng và bụng trắng. Trên đuôi có hai dải trắng tương tự chim đực.', NULL, 'Từ khoảng đèo Hải Vân đến hết Lâm Đồng.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4147, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Cochoa', NULL, 'GEN_0441', 'cochoaviridis', 'Cochoa viridis', 'Cochoa viridis', 'Cô cô xanh', 'SPA_04183', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4148, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Enicurus', NULL, 'GEN_0650', 'enicurusleschenaulti', 'Enicurus leschenaulti', '(Vieillot, 1818)            ', 'Chích choè nước đầu trắng', 'SPA_04184', '28cm. Giống như Chích chòe nước trán trắng, song lưng và ngực màu đen; trán trắng. sống: Rừng, kiếm ăn dọc theo các dòng suối, nơi có sỏi đá. Gặp đến độ cao 2.400 mét.', NULL, 'Từ Bắc Bộ đên Bắc Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4149, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Enicurus', NULL, 'GEN_0650', 'enicurusmaculatus', 'Enicurus maculatus', '(Vigors, 1831)', 'Chích choè nước đốm', 'SPA_04185', ' 28cm. Giống như Chích Chòe nước đầu trắng, nhưng có đốm trắng đậm hơn ở lưng.', NULL, ' Tây Bắc và Nam Trung Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(4150, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Enicurus', NULL, 'GEN_0650', 'enicurusschistaceus', 'Enicurus schistaceus', '(Hodgson, 1836)            ', 'Chích choè nước lưng xanh', 'SPA_04186', ' 25cm. Đuôi dài chẻ đôi sâu, bộ lông có màu sắc đẹp. Bay thấp dọc suối, phát ra tiếng kêu rin rít, đuôi luôn ve vẩy lúc đầu. Đây là loài chích chòe duy nhất lông đỉnh đầu và lưng màu xám xanh. Chim non có đầu và lưng trên màu nâu, ngực có vẩy. sống: Dọc theo các dòng suối ở rừng, những nơi có sỏi đá. Thường làm tổ ở vùng đồi núi. Gặp ở độ cao trong khoảng từ 400-2.200 mét.', NULL, 'Từ Bắc Bộ đến hết Nam Trung Bộ ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4151, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Enicurus', NULL, 'GEN_0650', 'enicurusscouleri', 'Enicurus scouleri', 'Vigors, 1832', 'Chích choè nước nhỏ', 'SPA_04187', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4152, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Enicurus', NULL, 'GEN_0650', 'enicurusshistaceus', 'Enicurus shistaceus', '(Hodgson, 1836)', 'Chích choè nước trán trắng', 'SPA_04188', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4153, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Erithacus', NULL, 'GEN_0669', 'erithacuscalliope', 'Erithacus calliope', 'David, 1877', 'Oanh cổ đỏ', 'SPA_04189', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4154, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Erithacus', NULL, 'GEN_0669', 'erithacuscyane', 'Erithacus cyane', '(Pallas, PS 1776)', 'Oanh lưng xanh', 'SPA_04190', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4155, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Erithacus', NULL, 'GEN_0669', 'erithacussibilans', 'Erithacus sibilans', 'Swinhoe, R 1863', 'Oanh cổ trắng', 'SPA_04191', '14cm. Phần trên cơ thể màu nâu xám, đuôi màu hung. Phía dưới màu trắng nhạt và có vảy hình lưỡi liềm màu nâu. Đuôi luôn ve vẩy và vểnh lên khi đứng. Tiếng kêu: ỏlách cáchõ. Vào mùa xuân có tiếng hót nghe như tiếng nước chảy róc rách với độ cao giảm dần.', NULL, ' Bắc Bộ và Trung Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4156, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Geokichla', NULL, 'GEN_0750', 'geokichlacitrina', 'Geokichla citrina', '(Latham, 1790)', 'Hoét vàng', 'SPA_04192', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4157, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Luscinia', NULL, 'GEN_1119', 'lusciniacalliope', 'Luscinia calliope', '(Pallas, 1776)', 'Oanh cổ đỏ', 'SPA_04193', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4158, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Luscinia', NULL, 'GEN_1119', 'lusciniacyane', 'Luscinia cyane', '(Pallas, 1776).', 'Oanh lưng xanh', 'SPA_04194', '15cm. Đuôi ngắn và không cao lên như ở các loài khác, mà nằm ngang, chỉ đập rất nhanh khi có hoạt động từ bên ngoài. Chân màu nhạt nhạt. Chim trống : Phía lưng màu xanh đậm, có đen rộng, phía bụng trắng. Chim mái : Phía lưng nâu xám, hông và hậu xanh nhạt, phía bụng màu trắng có nâu nhạt ở lót. Chim trống non : Giống như chim cái, song trên thu nhỏ xanh. Chim mái non : Có thể thiếu các vết màu xanh nhạt, sọc ở cánh màu nâu đậm.  sống: Rừng thứ sinh và vùng cây bụi dưới rừng rậm. Loài di cư. Tương thích các biến phổ biến trong bố cục các vùng.', NULL, 'Khắp các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4159, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Luscinia', NULL, 'GEN_1119', 'lusciniasibilans', 'Luscinia sibilans', '(Swinhoe, 1863). ', 'Oanh đuôi đỏ', 'SPA_04195', '14cm. Phần trên cơ thể màu nâu xám, đuôi màu hung. Phía dưới màu trắng nhạt và có vảy hình lưỡi liềm màu nâu. Đuôi luôn ve vẩy và vểnh lên khi đứng. Tiếng kêu: ỏlách cáchõ. Vào mùa xuân có tiếng hót nghe như tiếng nước chảy róc rách với độ cao giảm dần. sống: Lẩn tránh kiếm ăn trong các chỗ rậm rạp và giữa các đám cỏ cây mọc dưới tán rừng.  Tìm thấy về mùa đông. Số lượng chưa rõ.', NULL, 'Bắc Bộ và Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Birdwatchingvietnam'),
(4160, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Luscinia', NULL, 'GEN_1119', 'lusciniasvecica', 'Luscinia svecica', '(Linnaeus, 1758)', 'Oanh cổ xanh', 'SPA_04196', '15cm. Gốc các lông đuôi phía ngoài màu hung (nhìn rất rõ khi bay), lông mày trắng. Chim trống: Trong thời kì sinh sản trước ngực và họng có màu hung và xanh. Chim mái: Họng có đốm màu nâu sẫm và trắng sống: Các vùng đất trống, nhưng thường chui rúc trong các bụi rậm, cỏ cây và lau lách, nhất là chỗ gần nguồn nước. Di cư đến vào mùa đông, không phổ biến.', NULL, 'Từ Trung Bộ đến Bắc Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Birdwatchingvietnam'),
(4161, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Monticola', NULL, 'GEN_1251', 'monticolagularis', 'Monticola gularis', '(Swinhoe, 1863)            ', 'Hoét đá họng trắng', 'SPA_04197', '19cm. Chim trống: Đỉnh đầu màu xanh, phía bụng và hông màu hung nâu đỏ. Vào mùa đông, màu lông phía bụng có hình vẩy. Chim mái: Có vằn màu nâu và trắng. Màu ở họng khó thấy. Thường gặp ngồi thẳng người hay đứng yên trên các cành thấp.  sống: Trong các vùng rừng. Làm tổ trên các vùng đồi núi đá có cây cỏ bao phủ, mùa đông xuống đai thấp nơi có nhiều cây gỗ. Chỉ gặp vào mùa đông lên đến độ cao khoảng 1.000 mét. Số lượng không nhiều.O372', NULL, 'Từ Đông Bắc đến Nam Bộ.  ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4162, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Monticola', NULL, 'GEN_1251', 'monticolarufiventris', 'Monticola rufiventris', '(Jardine & Selby, 1833)', 'Hoét đá bụng trắng', 'SPA_04198', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4163, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Monticola', NULL, 'GEN_1251', 'monticolasolitarius', 'Monticola solitarius', '(Linnaeus, 1758)            ', 'Hoét đá', 'SPA_04199', '21-23cm. Có hai phân loài, chim đực thuộc phân loài pandoo toàn thân có màu xanh xám; còn phân loài philippensis (vào mùa đông) chim đực có màu hung từ phía dưới ngực đến dưới đuôi. Ngoài ra, còn có dạng trung gian giữa hai phân loại này. Chim mái có màu từ nâu rối đến xám bạc nhạt và phía bụng có thể có màu lông dạng vẩy xanh nhạt. Đuôi luôn ve vẩy. sống: Có thể gặp ở nhiều nơi, rừng thưa, rừng thứ sinh, núi đá kể cả vùng đá vôi và ven bờ biển nơi có vách đá, ở làng mạc và thành phố. Có thể phân bố đến độ cao gần 2.000 mét. Nói chung đây là loài chim di cư, gặp tương đối phổ biến ở nước ta. Tuy nhiên ở vùng Tây Bắc có quần thể sống định cư, không phổ biến; quần thể khác gặp ở Đông Bắc chỉ là loài bay qua đây.O373', NULL, 'Khắp cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4164, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Myrophoneus', NULL, 'GEN_1280', 'myrophoneuscaeruleus', 'Myrophoneus caeruleus', '(Scopoli, 1786)', 'Hoét xanh', 'SPA_04200', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4165, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Phoenicurus', NULL, 'GEN_1539', 'phoenicurusauroreus', 'Phoenicurus auroreus', '(Pallas, 1776)', 'Đuôi đỏ núi đá trán xám', 'SPA_04201', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4166, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Phoenicurus', NULL, 'GEN_1539', 'phoenicurusfrontalis', 'Phoenicurus frontalis', 'Vigors, 1831', 'Đuôi đỏ núi đá mày xanh', 'SPA_04202', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4167, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Phoenicurus', NULL, 'GEN_1539', 'phoenicurusfuliginosus', 'Phoenicurus fuliginosus', 'Vigors, 1831.', 'Đuôi đỏ đàu xám', 'SPA_04203', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4168, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Phoenicurus', NULL, 'GEN_1539', 'phoenicurusleucocephalus', 'Phoenicurus leucocephalus', '(Vigors, 1831)', 'Đuôi đỏ đầu trắng', 'SPA_04204', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4169, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Phoenicurus', NULL, 'GEN_1539', 'phoenicurusochruros', 'Phoenicurus ochruros', '(Gmelin, SG, 1774).', 'Đuôi đỏ núi đá chán đen', 'SPA_04205', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4170, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Turdus', NULL, 'GEN_2002', 'turdusboulboul', 'Turdus boulboul', '(Latham, 1790)', 'Hoét đen cánh trắng', 'SPA_04206', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4171, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Turdus', NULL, 'GEN_2002', 'turduscardis', 'Turdus cardis', '(Temminck, 1831)            ', 'Hoét bụng trắng', 'SPA_04207', '21cm. Tại vị trí quan sát tốt có thể thấy chim đực có đường phân giới rõ nét giữa màu đen ở trên ngực, phần dưới cơ thể màu trắng và mỏ màu vàng. Chim trống một năm tuổi, mặt bụng và họng màu xám bạc, giống như Hoét lưng đen; và chim cái cũng giống như chim cái loài đó, nhưng nhỏ hơn và sườn có ít màu hung, và nhiều đốm đen hơn.  sống: Rừng và ven các khu vực trồng trọt. Thích sống ở rừng gỗ. Nhút nhát. Sống đơn lẻ, lúc di chuyển thường bay theo đàn nhỏ. Phân bố đến độ cao khoảng 1.100 mét.', NULL, 'Bắc Bộ và Bắc Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4172, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Turdus', NULL, 'GEN_2002', 'turdusdissimilis', 'Turdus dissimilis', 'Blyth, 1847', 'Hoét ngực đen', 'SPA_04208', 'ngực đen có tổng chiều dài từ 22 cm đến 23,5 cm, bao gồm cả đuôi. Trong khi phần dưới có cùng màu cho cả hai giới thì phần trên và phần giữa là nơi chúng khác nhau. Đối với con đực, phần kéo dài từ đầu đến sau cổ và vùng ngực có màu đen, các vùng còn lại ở phía trên có màu xám đen. Mặt khác, con cái có màu nâu xám từ mắt đến đuôi, và phần từ cổ họng đến ngực của chúng là một màu da bò Môi trường sống ưa thích của chúng là các khu rừng vùng núi nhiệt đới và cận nhiệt đới ẩm ướt. Chúng thường được tìm thấy ở độ cao tương đối cao từ 1220 m đến 2500 m. Tuy nhiên, chúng có xu hướng hạ xuống độ cao thấp hơn trong mùa đông ở độ cao khoảng 200 m.', NULL, ' Nó được tìm thấy ở đông bắc Ấn Độ tới miền bắc Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'Thainationalparks'),
(4173, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Turdus', NULL, 'GEN_2002', 'turdushortulorum', 'Turdus hortulorum', 'Sclater, PL, 1863', 'Hoét lưng đen', 'SPA_04209', '23cm. Chim trống, phía lưng màu xám dễ thấy (độ đậm của màu có thể thay đổi), sườn và lông dưới cánh màu da cam. Chim mái và chim non, phía bụng màu nâu nhạt, có nhiều đốm đen ở trên ngực sống: Các vùng địa hình thấp. Thường sống ở gần mặt đất và tiêu tốn nhiều thời gian vào việc thu gom các mảnh lá vụn, khi bị quấy nhiễu thường nhảy và tỏ vẻ giận dữ. Rất nhút nhát, gặp kiếm ăn ở các bãi cỏ yên tĩnh. Di cư đến trong mùa đông. Hiếm.O379', NULL, ' Bắc Bộ và Bắc Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4174, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Turdus', NULL, 'GEN_2002', 'turdusmandarinus', 'Turdus mandarinus', '(Bonaparte, 1850)', 'Hoét đen', 'SPA_04210', 'Mô tả: 28cm. Phần lớn Hoét đen đều có phần trên cơ thể màu đen và đen nâu nhạt; phía bụng đen nâu nhạt phớt xanh nhạt, đôi khi họng có sọc. Mỏ có nhiều màu, từ vàng đến nâu nhạt, vành mắt màu vàng. Tiếng kêu: ‘dzib’ trong khi bay. Thỉnh thoảng nghe hót vào đầu mùa hè.', NULL, 'Phân bố: Bắc Bộ và Trung Trung Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/vietnamese-name/chinese-blackbird-945'),
(4175, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Turdus', NULL, 'GEN_2002', 'turdusmerula', 'Turdus merula', 'Linnaeus, 1758', 'Hoét đen', 'SPA_04211', 'Con đực có màu đen hoàn toàn trong khi con cái thường có màu nâu. Con đực có mỏ màu vàng sáng hoặc màu cam trong khi mỏ con cái có màu từ nâu đến nâu sẫm. Mắt ở con đực được viền bằng một vòng mắt màu vàng sáng. nặng trung bình 102,06 gam. Chim đen có chiều dài khoảng 25 cm với sải cánh dài từ 34-38 cm. Những con non được sinh ra không có lông. thường sinh sản từ tháng 3 đến tháng 6. Trung bình từ 2 đến 6 tổ mỗi năm. Mỗi tổ chứa trung bình 3 quả trứng và tổng số trứng có thể lên tới 24 quả mỗi năm. được tìm thấy nhiều nhất ở các khu vực thành thị bao gồm vườn, công viên và bụi cây trong thị trấn. Nó cũng có thể được tìm thấy ở các vùng đất nông nghiệp có hàng rào và khu rừng.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Animaldiversity'),
(4176, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Turdus', NULL, 'GEN_2002', 'turdusnaumanni', 'Turdus naumanni', 'Temminck, 1820', 'Hoét lưng hung', 'SPA_04212', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4177, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Turdus', NULL, 'GEN_2002', 'turdusobscurus', 'Turdus obscurus', 'Gmelin, JF, 1789', 'Hoét mày trắng', 'SPA_04213', 'Chim trống và chim cái đều có lông mày và đốm màu trắng dưới mắt nên dễ nhận dạng. Chim trống có đầu màu xám, phía lưng màu nâu ô-liu, mặt bụng có màu vàng da cam. Chim mái có màu xám hơn, đầu màu nâu ô liu, họng trắng có sọc vằn màu nâu. Chim non có màu giống như chim cái, nhưng đôi khi cánh cụp để lộ vằn mỏng màu xanh nhạt.  ', NULL, 'Từ Bắc Bộ đến Nam Bộ, nhưng chưa tìm thấy ở vùng Bắc Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(4178, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Turdus', NULL, 'GEN_2002', 'turdusrubrocanus', 'Turdus rubrocanus', 'Gray & Gray, 1847', 'Hoét hung', 'SPA_04214', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4179, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Turdus', NULL, 'GEN_2002', 'turdusruficollis', 'Turdus ruficollis', 'Pallas, 1776', 'Hoét họng đen', 'SPA_04215', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4180, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Zoothera', NULL, 'GEN_2080', 'zootheracitrina', 'Zoothera citrina', '(Latham, 1790)', 'Hoét vàng', 'SPA_04216', '22cm. Bộ lông có màu vàng cam và xám dễ phân biệt. Chim mái và chim non tương tự như vậy, nhưng phía lưng màu nâu ô liu. sống: Rừng thường xanh và các vùng cây bụi thứ sinh khác. Có thể gặp lên tới khoảng 1.500 mét. Kiếm ăn ở mặt đất. Có các quần thể định cư và di cư. Thỉnh thoảng tìm thấy ở một vài nơi.O375', NULL, 'Trung và Nam Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4181, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Zoothera', NULL, 'GEN_2080', 'zootheradauma', 'Zoothera dauma', '(Holandre, 1825).', 'Sáo đất', 'SPA_04217', 'Bộ lông mùa Đông. Mặt lưng hung nâu nhạt, mỗi lông có một mép viền đen ở mút và một điểm vàng hung ở gần mút. Lông bao cánh nhỏ nâu thẫm, mỗi lông có một vệt lớn màu vàng hung ở gần mút. Lông bao cánh nhỏ nâu thẫm, mỗi lông có một vệt lớn màu vàng hung nhạt ở mút lông, lông bao cánh nhỡ cũng tương tự nhưng mép lông cũng viền vàng hung, còn lông bao cánh lớn thì có phần giữa của phiến lông ngoài cùng vàng hung. Lông cánh nâu viền vàng hung, lông đuôi giữa nâu vàng lục nhạt, các lông khác nâu thẫm với mép ngoài màu nhạt và mút trắng. Hai bên đầu hung vàng nhạt có điểm đen, sau tai có vệt đen lớn do mút đen của các lông tai tạo thành. Mặt bụng trắng phớt hung vàng, nhất là ở ngực và có vằn ngang đen từ họng và giữa bụng. Dưới cánh và nách đen lẫn trắng. Số lông đuôi 12 – 14. Bộ lông mùa hè. Nhìn chung tươi hơn, các vệt và vân rõ hơn. Mắt nâu thẫm. Mỏ nâu sừng, mỏ dưới màu hơi nhạt hơn. Chân nâu hồng nhạt. Cánh: 130 – 147; đuôi: 93 – 103; giò: 33 – 34; mỏ: 29 – 30mm.', NULL, 'Ba Vì', NULL, NULL, NULL, NULL, NULL, NULL, 'Đỗ Tước và Đặng Thanh Long (2013). Chuyên đề điều tra đa dạng động vật rừng trên địa bàn thành phố Hà Nội. Chi Cục Kiểm lâm Hà Nội'),
(4182, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Zoothera', NULL, 'GEN_2080', 'zootheramarginata', 'Zoothera marginata', '(Blyth, 1847)', 'Sáo đất nâu', 'SPA_04218', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4183, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Zoothera', NULL, 'GEN_2080', 'zootheramollissima', 'Zoothera mollissima', '(Blyth, 1842).', 'Sáo đất nâu hung', 'SPA_04219', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4184, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdidae', 'Chích Chòe', 'FAM_382', 'Zoothera', NULL, 'GEN_2080', 'zootherasibirica', 'Zoothera sibirica', '(Pallas, 1776)', 'Hoét Sibêri', 'SPA_04220', '24cm. Khi bay để lại hai vằn trắng có thể nhìn rõ ở mặt dưới cánh (đặc điểm điển hình của giống Zoothera) và mút lông đuôi ngoài trắng. Chim mái và chim non: Có màu sắc khác nhau, lông màu trắng. Phía lưng màu nâu tối (đôi khi có màu nâu xám), ngực có màu nâu tối. sống: Rừng thường xanh, vùng cây bụi thứ sinh và chỗ rậm rạp ở rừng. Gặp vào mùa đông+O376', NULL, 'Bắc Bộ, Trung Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4185, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdindae', 'Chích Choè', 'FAM_383', 'Tarsiger', NULL, 'GEN_1915', 'tarsigercyanurus', 'Tarsiger cyanurus', '(Pallas, 1773)', 'Hoét đuôi cụt lưng xanh', 'SPA_04221', ' 15cm. Chim trống và chim cái đều có sườn màu da cam hung, đuôi màu xanh. Chim trống trưởng thành có màu xanh biếc ở phía lưng. Chim mái và chim non: Có màu ô liu ở phía trên, họng trắng dễ nhận sống: Vùng cây bụi thứ sinh và dưới tán rừng. Làm tổ vùng núi cao. Sống ở tầng thấp của rừng cây gỗ thưa. Loài di cư, ít gặp.O367', NULL, 'Từ Bắc Bộ đến Kontum ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4186, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Turdindae', 'Chích Choè', 'FAM_383', 'Tarsiger', NULL, 'GEN_1915', 'tarsigerindicus', 'Tarsiger indicus', '(Vieillot, 1817)', 'Oanh đuôi nhọn mày trắng', 'SPA_04222', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4187, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Zosteropidae', 'Vành Khuyên', 'FAM_398', 'Zosterops', NULL, 'GEN_2081', 'zosteropserythropleura', 'Zosterops erythropleura', 'R. Swinhoe, 1863', 'Vành khuyên sườn hung', 'SPA_04223', '12cm. Khác với loài trên chủ yếu bởi mặt lưng có màu xám xịt hơn và sườn màu hung đậm.', NULL, 'Tây Bắc.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(4188, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Zosteropidae', 'Vành Khuyên', 'FAM_398', 'Zosterops', NULL, 'GEN_2081', 'zosteropsjaponica', 'Zosterops japonica', 'Swinhoe, 1863', 'Vành khuyên nhật bản', 'SPA_04224', 'Chim có màu xanh ô liu trên lưng, từ phía trước đến phía sau, và có màu xanh lục nhạt ở mặt dưới. Bàn chân, chân và mỏ của nó có màu từ đen đến nâu. Chim có đôi cánh tròn và chiếc mỏ dài, mảnh - cả hai đều cho thấy loài chim này có khả năng nhào lộn rất tốt. Cánh của nó có màu nâu sẫm, nhưng viền ngoài có màu xanh lục. Con trưởng thành có chiều dài từ 4 đến 4,5 inch, và nặng từ 9,75 đến 12,75 gam.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4189, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Zosteropidae', 'Vành Khuyên', 'FAM_398', 'Zosterops', NULL, 'GEN_2081', 'zosteropspalpebrosus', 'Zosterops palpebrosus', '(Temminck, 1824)            ', 'Vành khuyên họng vàng', 'SPA_04225', 'Loài chim này nhỏ (dài khoảng 8–9 cm) với phần trên màu ô liu màu vàng, vòng mắt màu trắng, cổ họng màu vàng và lỗ thông hơi. Bụng có màu trắng xám nhưng có thể có màu vàng ở một số phân loài.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4190, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PASSERIFORMES', 'SẺ', 'ORD_060', 'Zosteropidae', 'Vành Khuyên', 'FAM_398', 'Zosterops', NULL, 'GEN_2081', 'zosteropssimplex', 'Zosterops simplex', '(Swinhoe, 1861)', 'Vành khuyên nhật bản', 'SPA_04226', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4191, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PELECANIFORMES', 'BỒ NÔNG', 'ORD_061', 'Pelecanidae', 'Bồ Nông', 'FAM_277', 'Pelecanus', NULL, 'GEN_1492', 'pelecanusphilippensis', 'Pelecanus philippensis', 'Gmelin, 1789', 'Bồ Nông chân xám', 'SPA_04227', ' 139,7cm. Chim trưởng thành bộ lông có màu trắng ngà, mỏ to, nhọn, chóp mỏ trên có móng cong, mỏ dưới có màng da rất rộng không có lông. Lông cánh sơ cấp màu đen, các lông cánh thứ cấp màu nâu tối; lông trên cổ màu nâu; chân có màng bơi rộng, màu nâu tối hoặc sáng tối. Trong mùa sinh sản: Trên gáy có mào lông như bờm ngựa; lưng dưới màu hơi hồng. Chim non như con trưởng thành, nhưng phần trên cơ thể màu nâu nhạt, phần dưới cơ thể trắng nhạt phớt nâu. Các hồ, đầm lớn, sông, vùng cửa sông và dọc bờ biển.  Loài định cư. Hiếm.', NULL, 'Làm tổ ở các bờ sông lớn ở Nam Bộ, Bắc Bộ và Trung Bộ. Thường gặp ở các vùng cửa sông lớn của Đồng bằng Sông Hồng: Sông đáy, Sông Hồng (cửa Ba Lạt), Sông Thái Bình và Văn Úc; Đồng bằng Sông Mê Kông và ven biển Duyên Hải Trung Bộ. ', NULL, NULL, NULL, NULL, 'NT', NULL, 'birdwatchingvietnam'),
(4192, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PELECANIFORMES', 'BỒ NÔNG', 'ORD_061', 'Phalacrocoracidae', 'Cốc', 'FAM_280', 'Microcarbo', NULL, 'GEN_1217', 'microcarboniger', 'Microcarbo niger', '(Vieillot, 1817).', 'Cốc đen', 'SPA_04228', 'Chim trưởng thành:\n\nBộ lông mùa hè. Nhìn chung toàn bộ lông màu đen ánh xanh. Lưng, các lông cánh thứ cấp cuối cùng và các lông bao cánh đen xám thẫm viền đen. Một vài lông bông xoăn màu trắng rải rác ở trước, hai bên đầu và cổ. Bộ lông mùa đông. Các lông xoăn trắng ở đầu và cổ biến mất, các lông ở gốc mỏ dưới trắng, đôi khi các lông này lan đến họng.\n\nChim non:\n\nMàu nâu, các lông ở lưng thường viền nâu nhạt hơn. Vai và các lông cánh thứ cấp cuối cùng xám, viền trắng nhạt. Họng và phần giữa bụng trắng, các lông ở hai sườn và ở ngực có vạch nâu rất nhạt. Mắt lục. Mỏ nâu sừng, chóp mỏ đen nhạt, gốc mỏ đỏ. Túi da và da trần quanh mắt thường màu đen vào mùa sinh sản pha màu đỏ. Chân đen nhạt và phớt đỏ vào mùa sinh sản.\nKích thước:\nCánh: 181 - 205; đuôi: 130 - 140; giò: 35 - 38; mỏ: 30 - 32. ', NULL, 'Việt Nam: loài này có ở các vùng đồng bằng từ Bắc chí Nam. Cốc đen phân bố ở vùng Đông nam Á, Trung Quốc (từ Bắc đến Đông nam Vân Nam và Nam Quảng Đông, Hải Nam), Việt Nam, Lào, Campuchia, Mã Lai, Ấn Độ, Java, Xumatra và Bocnêô.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4193, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PELECANIFORMES', 'BỒ NÔNG', 'ORD_061', 'Phalacrocoracidae', 'Cốc', 'FAM_280', 'Phalacrocorax', NULL, 'GEN_1515', 'phalacrocoraxcarbo', 'Phalacrocorax carbo', '(Linnaeus, 1758) ', 'Cốc đế', 'SPA_04229', 'Về mùa hè phần đầu, toàn bộ mặt trên thân, đuôi có màu đen ánh xanh, đen ánh xanh hay tím đỏ tùy góc nhìn. Trước mắt, chớp và trước má cùng một chiều rộng sau sườn màu trắng. Toàn bộ đầu và cổ có lông bông che gần hết các loại lông màu đen, lông cánh sơ cấp đen. Vai, lông cánh còn lại Nâu đồng, mỗi lông đều có viền đen.Vào mùa đông, lông bông ở đầu và cổ và lông trắng ở hai bên sườn biến mất ăn chủ yếu của kem đế là những loài cá nhỏ: cá rô Anabas testudineus , cá lóc Channa micropeltes , cá bọ Pseudapocryptes taenisgastes ,đôi khi ăn cả một vài loài lưỡng cư có kích thước nhỏ. Cách kiếm ăn là chụp trong nước bằng cánh lặn trong nước. Sau khi kiếm đủ thức ăn thường có tập phơi nắng. Làm tổ tập đoàn ở các sân chim ở đồng bằng sông Cửu Long. Mùa sinh sản hàng năm từ tháng 6 - 8, thời gian làm tổ từ 10 - 15 ngày, mỗi kiến ​​sinh 4 - 6 trứng, số ngày ấp từ 24 - 26 ngày. Cốc đếm tập đoàn thường sống, tập trung ở vùng đồng bằng tại những vùng đất ngập nước , đôi khi còn gặp ở vùng núi nơi có hồ hay đập nước lớn. Loài này thường sống cùng sinh cảnh với 2 loài khác là Cốc đế nhỏ Phalacrocorax fuscicollis và Cốc đen Phalacrocorax niger.', NULL, 'Trong nước: Đồng bằng Nam bộ, thường làm tổ tại các sân chim Tỉnh Bạc Liêu, Cà Mau, Đồng Tháp, Sóc Trăng. Đã từng gặp ở Quảng Ninh (tháng 12/2001 và 2/2002). Thế giới: Trung Á, Ấn Độ, Trung Quốc, Triều Tiên, Nhật Bản, Xri Lanka, Mianma, Thái Lan, Cămpuchia, Lào, Malaixia, Philippin.', NULL, NULL, 'Nguồn gen qúy, có giá trị học cao.', 'EN', NULL, NULL, 'VnCreature'),
(4194, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PELECANIFORMES', 'BỒ NÔNG', 'ORD_061', 'Phalacrocoracidae', 'Cốc', 'FAM_280', 'Phalacrocorax', NULL, 'GEN_1515', 'phalacrocoraxfuscicollis', 'Phalacrocorax fuscicollis', 'Stephens, 1826', 'Cốc đế nhỏ ', 'SPA_04230', 'Chim trưởng thành: Bộ lông mùa hè.Lông vai và lông cánh nâu đồng thẫm, có viền đen. Xung quanh mép da trần ở túi họng có viền một dải lông trắng. Một túm lông sau mắt và nhiều điểm rải rác ở đầu và cổ màu trắng. Toàn bộ phần còn lại của bộ lông màu đen ánh lục.\nChim non: Mặt trên thân nâu, vai nâu đồng nhưng mỗi lông đều có viền đen. Đuôi và các lông cánh sơ cấp nâu thẫm. Cằm và họng trắng. Phía trước cổ nâu.\nMắt lục hay xanh lục. Mỏ nâu thẫm, gốc mỏ dưới đỏ nhạt. Da túi họng vàng. Da trần ở mặt đen phớt đỏ trong mùa sinh sản, sau chuyển thành màu vàng. Chân đen.\nKích thước: Cánh: 257 - 276; đuôi: 140; giò: 50; mỏ: 55 mm. ', NULL, 'Việt Nam: loài này phổ biến ở Nam Bộ. Loài cốc này phân bố Ấn Độ, Miến Điện, Việt Nam và Campuchia', NULL, NULL, NULL, NULL, NULL, NULL, 'Vncreatures'),
(4195, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PELECANIFORMES', 'BỒ NÔNG', 'ORD_061', 'Phalacrocoracidae', 'Cốc', 'FAM_280', 'Phalacrocorax', NULL, 'GEN_1515', 'phalacrocoraxniger', 'Phalacrocorax niger', '(Vieillot, 1817).', 'Cốc đen', 'SPA_04231', 'Chim trưởng thành: Bộ lông mùa hè. Nhìn chung toàn bộ lông màu đen ánh xanh. Lưng, các lông cánh thứ cấp cuối cùng và các lông bao cánh đen xám thẫm viền đen. Một vài lông bông xoăn màu trắng rải rác ở trước, hai bên đầu và cổ. Bộ lông mùa đông. Các lông xoăn trắng ở đầu và cổ biến mất, các lông ở gốc mỏ dưới trắng, đôi khi các lông này lan đến họng.\nChim non: Màu nâu, các lông ở lưng thường viền nâu nhạt hơn. Vai và các lông cánh thứ cấp cuối cùng xám, viền trắng nhạt. Họng và phần giữa bụng trắng, các lông ở hai sườn và ở ngực có vạch nâu rất nhạt. Mắt lục. Mỏ nâu sừng, chóp mỏ đen nhạt, gốc mỏ đỏ. Túi da và da trần quanh mắt thường màu đen vào mùa sinh sản pha màu đỏ. Chân đen nhạt và phớt đỏ vào mùa sinh sản.\nCánh: 181 - 205; đuôi: 130 - 140; giò: 35 - 38; mỏ: 30 - 32. ', NULL, 'Việt Nam: loài này có ở các vùng đồng bằng từ Bắc chí Nam. Cốc đen phân bố ở vùng Đông nam Á, Trung Quốc (từ Bắc đến Đông nam Vân Nam và Nam Quảng Đông, Hải Nam), Việt Nam, Lào, Campuchia, Mã Lai, Ấn Độ, Java, Xumatra và Bocnêô.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4196, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PELECANIFORMES', 'BỒ NÔNG', 'ORD_061', 'Threskiornithidae', 'Cò Quăm', 'FAM_374', 'Plegadis', NULL, 'GEN_1586', 'plegadisfalcinellus', 'Plegadis falcinellus', '(Linnaeus, C 1766).', 'Quắm đen ', 'SPA_04232', '64cm. Bộ lông có màu đen nếu nhìn từ xa. Chim khi không ở thời kì sinh sản đầu và cổ viền trắng. Trong ánh sáng mờ có thể nhầm với loài Rẽ mỏ cong nhưng có tư thế thẳng đứng, có dáng đứng giống loài Diệc và có cánh tròn.', NULL, 'Đồng bằng sông Cửu Long (các sân chim, nhiều vùng rừng tràm và vườn cây gỗ). Gặp nhiều ở U Minh Thượng, Kiên Giang, Vườn chim Trà Cú, Láng Sen, Trà Vinh…', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/group/glossy-ibis-482'),
(4197, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PELECANIFORMES', 'BỒ NÔNG', 'ORD_061', 'Threskiornithidae', 'Cò Quăm', 'FAM_374', 'Pseudibis', NULL, 'GEN_1646', 'pseudibisgigantea', 'Pseudibis gigantea', '(Oustalet , 1877)', 'Quắm lớn', 'SPA_04233', 'Chiều dài thân: 102-106 cm. Con trưởng thành có kích thước lớn, tối màu. Lông ở đầu, cổ xám nhạt, và có mút lông màu đen. Thân có màu đen nhạt ngược lại với màu cánh xám nhạt và cuối mỗi lông có viền đen. Mỏ dài và cong. Giò đỏ nhạt. Quắm lớn cư trú trong các hồ, suối lớn, và bãi sình lầy ở các vùng rừng trống trải, nhất là rừng cây họ dầu, trên các đai địa hình đồi núi thấp. Trước đây còn gặp ở ruộng lúa. Thường kiếm ăn ở chỗ sình lầy và cả trên các bãi khô, gặp chúng đi lẻ, đi đôi, hay theo đàn nhỏ. Thức ăn là các loài động vật không xương sống, một số loài bò sát, ếch nhái có kích thước nhỏ.\nChưa có số liệu về tập tính sinh sản. Tuy nhiên, người ta biết chúng thường làm tổ trên cây. Phần lớn sống định cư, nhưng cũng có trường hợp một vài quần thể phải thay đổi vùng sống do sự quấy nhiễu của con người hay sự biến động của mực nước tự nhiên trong vùng cư trú', NULL, ' Nam Trung Bộ và Nam Bộ.  Thái Lan, Cămpuchia, Lào', NULL, NULL, 'Loài chim đặc hữu của vùng Đông Dương (kể cả Thái Lan).', 'DD', NULL, NULL, 'vncreatures'),
(4198, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PELECANIFORMES', 'BỒ NÔNG', 'ORD_061', 'Threskiornithidae', 'Cò Quăm', 'FAM_374', 'Threskiornis', NULL, 'GEN_1955', 'threskiornismelanocephalus', 'Threskiornis melanocephalus', '(Latham, 1790). ', 'Quắm đầu đen ', 'SPA_04234', '76cm. Bộ lông trắng, mỏ dài hơi cong, đầu và cổ đen không có lông. Trong mùa sinh sản, lông màu xám nhô lên ở đuôi và khi bay có thể thấy một dải màu đỏ máu của lớp da trần ở mặt dưới cánh. Chim non có một vài lông màu xám nhạt ở trên đầu và mút ngoài của các lông cánh sơ cấp màu đen.', NULL, 'Đồng bằng Bắc Bộ, Nam Trung Bộ và Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/science-name/black-headed-ibis-483'),
(4199, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Megalaima', NULL, 'GEN_1177', 'megalaimaannamensis', 'Megalaima annamensis', '(Collar & Feinstein, 2008)', 'Cu rốc trán vàng', 'SPA_04235', 'Cánh: 82 - 97; đuôi: 65; giò: 25; mỏ: 32 mm. Hai bên trán có hai điểm đỏ thẫm. Một vệt ở gáy và hai vệt ở hai bên cổ đỏ hơi nhạt hơn.Trán, đỉnh đầu và họng vàng nhạt. Trên mắt có dải lông mày rộng và màu đen viền xanh ở mép trên và dưới xung quanh mắt, tai và vòng trước cổ xanh. Phần còn lại của bộ lông lục tương tự như M.asiatica davisoni mép cánh và mép ngoài các lông cánh sơ cấp phớt xanh.\nMắt nâu. Da quanh mắt nâu vàng nhạt. Mỏ đen, gốc mỏ xám. Chân vàng lục. ', NULL, 'Loài cu rốc này có ở Nam Lào và miền Nam Trung bộ Việt Nam (Đà Lạt, Di Linh ', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4200, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Megalaima', NULL, 'GEN_1177', 'megalaimaasiatica', 'Megalaima asiatica', '(Latham, 1790)', 'Cu rốc đầu đỏ', 'SPA_04236', 'Chim trưởng thành: Trán, phần trước gáy và hai điểm ở hai bên họng đỏ tươi. Một dải rộng ở giữa đỉnh đầu trước mắt, má, tai, cằm và họng xanh nhạt. Toàn bộ phần còn lại của bộ lông lục, mặt lưng hơi thẫm hơn, mặt bụng nhạt hơn và hơi phớt vàng. Lông cánh đen nhạt, mép ngoài lục, mép trong trắng nhạt. Mắt dưới của lông đuôi phớt xanh. Mắt nâu. Da quanh mắt vàng nhạt. Mỏ đen hay nâu thẫm, gốc mỏ trắng lục nhạt. Chân xám lục nhạt. Kích thước: Cánh: 92 - 110; đuôi: 62 - 70; giò: 25 - 26; mỏ: 23 - 27 mm. ', NULL, 'Việt Nam: loài này có ở hầu hết các vùng, những chỗ có nhiều cây cối rậm rạp và không cao quá 800 m. Hình như biên giới phía Nam của vùng phân bố của cu rốc đầu đỏ là Quảng Bình. ', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4201, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Megalaima', NULL, 'GEN_1177', 'megalaimaaustralis', 'Megalaima australis', '(Horsfield , 1821)', 'Cu rốc đầu đen', 'SPA_04237', 'có chiều dài 17–18 cm. Đó là một loài chim bụ bẫm, cổ ngắn, đầu to và đuôi ngắn. Mỏ có màu sẫm và bộ lông trên cơ thể có màu xanh lục, nhưng các phân loài có kiểu đầu khác nhau, có trán màu đen, phần giữa trán màu xanh, tấm che tai và cổ họng, các vết màu đỏ ở trên và dưới tấm che tai, và má màu cam. Con cái có đầu xỉn màu hơn với tông màu cam hơn ở các mảng phía trên và bên dưới vành tai, còn con non có đầu màu xanh lá cây với một số màu xanh lam trên vành tai và cổ họng. Đây là một loài rừng thường xanh lá rộng, rừng hỗn hợp và sinh trưởng thứ hai ở độ cao tới 1525 m. Nó làm tổ trong một lỗ cây.', NULL, ' đông bắc Ấn Độ về phía đông qua Đông Nam Á đến Singapore, Indonesia và Borneo', NULL, NULL, NULL, NULL, NULL, NULL, 'Scientificlib'),
(4202, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Megalaima', NULL, 'GEN_1177', 'megalaimafaiostricta', 'Megalaima faiostricta', '(Temminck, 1831)            ', 'Cu rốc đầu xám', 'SPA_04238', '24,5-27cm. Chim trưởng thành giống Cu rốc bụng nâu, nhưng nhỏ hơn. Mỏ và da quanh mắt tối màu, có túm lông đỏ ở ngực. sống: Các vùng rừng khác nhau, ở khu vực rừng thưa. Gặp lên độ cao khoảng 1.000 mét. Sinh sản vào thời gian tháng 2-5. Làm tổ ở hốc cây.', NULL, 'Khắp các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4203, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Megalaima', NULL, 'GEN_1177', 'megalaimafranklinii', 'Megalaima franklinii', '(Blyth, 1842)            ', 'Cu rốc đầu vàng', 'SPA_04239', 'có màu xanh lá cây sống động ở trên với bộ lông màu xanh lục vàng nhạt hơn ở bên dưới, đôi cánh màu xanh đậm và xanh tươi bên dưới đuôi. Mỏ của nó có màu đen sẫm và xung quanh mắt có màu đen. Trán của nó có màu đỏ thẫm và cổ họng có màu cam. Chân của nó có màu xanh lục. [2] Nó dài 20,5–23,5 cm (8,1–9,3 in) và nặng 50–101 g (1,8–3,6 oz). [10]', NULL, 'Cu rốc họng vàng phân bố ở Nepal , Ấn Độ , Bhutan , Myanmar , Thái Lan , Malaysia , Lào , Việt Nam và Trung Quốc đại lục . Sự hiện diện của nó ở Bangladesh là không chắc chắn. Nó sinh sống ở các khu rừng ẩm nhiệt đới và cận nhiệt đới ở độ cao từ 900 đến 2.700 m (3.000 đến 8.900 ft). [1', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Golden-throated_barbet'),
(4204, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Megalaima', NULL, 'GEN_1177', 'megalaimahaemacephala', 'Megalaima haemacephala', '(Statius Muller, 1776)', 'Cu rốc cổ đỏ', 'SPA_04240', 'Con barbet thợ đồng có màu xanh lá cây với đầu màu đỏ, má màu vàng và cổ họng màu vàng. Phần dưới của nó có sọc màu xám và đen. [2] Trong mùa làm tổ, sự hao mòn của lông có thể khiến bộ lông ở lưng trên có màu hơi xanh. [3] Nó dài 15–17 cm (5,9–6,7 in) và nặng 30–52,6 g (1,06–1,86 oz). [4]', NULL, 'Ở vùng đồi Palni nó xuất hiện ở độ cao dưới 1.200 m (4.000 ft). [16] Ở miền bắc Ấn Độ, nó xuất hiện ở các thung lũng thuộc dãy Himalaya bên ngoài lên tới 910 m (3.000 ft). Nó rất hiếm ở các bang phía tây bắc Ấn Độ và trong các khu rừng ẩm ướt ở Assam', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Coppersmith_barbet'),
(4205, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Megalaima', NULL, 'GEN_1177', 'megalaimalagrandieri', 'Megalaima lagrandieri', '(Verreaux, 1868)', 'Thầy chùa đít đỏ', 'SPA_04241', 'Thầy chùa đít đỏ là loài có kích thước lớn trong nhóm thầy chùa/cu rốc (khoảng 30 cm). Chim có mỏ lớn màu xám đậm, túm lông trán màu đỏ cam, đỉnh đầu đến gáy màu nâu đậm, má và cổ màu xám nhạt, toàn thân màu xanh lá cây đối lập với bao đuôi dưới màu đỏ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4206, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Megalaima', NULL, 'GEN_1177', 'megalaimalineata', 'Megalaima lineata', '(Vieillot, 1816)', 'Cu rốc bụng nâu', 'SPA_04242', 'Chim trưởng thành: Đầu và cổ nâu vàng nhạt, mỗi lông ít nhiều có mút trắng nhạt và trông như có vạch. Toàn mặt lưng lục đều. Cằm trắng nhạt: họng, ngực và phần trên bụng nâu vàng nhạt, mỗi lông đều có vạch rộng trắng nhạt ở dọc thân lông. Phần sau bụng, sườn và dưới đuôi phớt lục. Lông cánh tương tự như ở loài M. faiostricta. Mắt nâu. Mỏ và da trần quanh mắt vàng đất. Chân vàng. Kích thước: Cánh: 117 – 139; đuôi: 84; giò: 29; mỏ: 31mm. ', NULL, 'Việt Nam có thể gặp loài này ở khắp nơi từ Quảng Trị trở vào Nam như Núi Dinh Bà Rịa – Vũng Tàu, núi Chứa Chan, Xuân Lộc – Đồng Nai Loài cu rốc này phân bố ở Himalai, Miến Điện, Thái Lan và Đông Dương', NULL, NULL, NULL, NULL, NULL, NULL, 'Agriviet'),
(4207, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Megalaima', NULL, 'GEN_1177', 'megalaimaoorti', 'Megalaima oorti', '(Robinson et Kloss)', 'Cu rốc trán vàng', 'SPA_04243', 'Chim trưởng thành: Hai bên trán có hai điểm đỏ thẫm. Một vệt ở gáy và hai vệt ở hai bên cổ đỏ hơi nhạt hơn.Trán, đỉnh đầu và họng vàng nhạt. Trên mắt có dải lông mày rộng và màu đen viền xanh ở mép trên và dưới xung quanh mắt, tai và vòng trước cổ xanh. Phần còn lại của bộ lông lục tương tự như M.asiatica davisoni mép cánh và mép ngoài các lông cánh sơ cấp phớt xanh. Mắt nâu. Da quanh mắt nâu vàng nhạt. Mỏ đen, gốc mỏ xám. Chân vàng lục. Kích thước: Cánh: 82 – 97; đuôi: 65; giò: 25; mỏ: 32 mm. ', NULL, ' miền Nam Trung bộ Việt Nam (Đà Lạt, Di Linh). Loài cu rốc này có ở Nam Lào', NULL, NULL, NULL, NULL, NULL, NULL, 'Agriviet'),
(4208, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Megalaima', NULL, 'GEN_1177', 'megalaimavirens', 'Megalaima virens', '(Boddaert, 1783)            ', 'Cu rốc lớn', 'SPA_04244', 'Chim trưởng thành: Các lông ở đầu và cổ đen. Vai, lưng, lông bao cánh nhỏ và nhỡ nâu đỏ thẫm, chuyển thành lục nâu nhạt ở phần dưới lưng và lục tươI ở hông, trên đuôi và đuôi. Mặt dưới đuôi phớt xanh. Lông bao cánh lớn lục tươi, lông bao cánh sơ cấp xanh. Lông cánh sơ cấp ngoài đen có mép ngoài xám ở phần mút và xanh ở phần gốc; lông cánh thứ cấp nâu với phiến ngoài lục, lông cánh tam cấp lục, haị lông cuối cùng phớt xanh. Ngực nâu đỏ thẫm, giữa bụng xanh lục nhạt hai bên bụng vàng úo vằn nâu lục nhạt. Dưới đuôi đỏ. Chim non: Màu thẫm hơn, mặt bụng xanh nhạt lẫn nâu thẫm. Mắt nâu. Mỏ vàng xám, mút và sống mỏ đen nhạt. Chân lục. Kich thước: Cánh: 132 - 151; đuôi: 94 - 97; giò: 31 - 32; mỏ: 39 - 46 mm.\n ', NULL, 'Ở Việt Nam đã bắt được loài cu rốc nà ở Lạng Sơn, Bắc Cạn, Lào Cai, Sơn la và Hoàng liên sơn. u rốc lớn phân bố ở Miến Điện, Thái Lan, Nam Trung Quốc và Bắc Đông Dương', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4209, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Psilopogon', NULL, 'GEN_1669', 'psilopogonannamensis', 'Psilopogon annamensis', '(Robinson & Kloss, 1919).', 'Cu rốc đông dương ', 'SPA_04245', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4210, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Psilopogon', NULL, 'GEN_1669', 'psilopogonasiaticus', 'Psilopogon asiaticus', '(Latham, 1790).', 'Cu rốc đầu đỏ', 'SPA_04246', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4211, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Psilopogon', NULL, 'GEN_1669', 'psilopogonauricularis', 'Psilopogon auricularis', '(Blyth, 1842).', 'Cu rốc họng vàng ', 'SPA_04247', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4212, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Psilopogon', NULL, 'GEN_1669', 'psilopogonaustralis', 'Psilopogon australis', '(Horsfield, 1821)', 'Cu rốc đầu đen', 'SPA_04248', 'bộ lông màu xanh lá cây và những đốm màu đỏ thẫm trên má. Cổ họng và tấm che tai của nó có màu xanh xanh. Một dải màu đen chạy giữa cổ họng và ngực. Nó dài 16 - 17 cm.Cổ ngắn, đầu to và đuôi ngắn. Con đực trưởng thành có trán màu đen. Con cái có đầu xỉn màu hơn với tông màu cam hơn ở các mảng phía trên và bên dưới vành tai, còn con non có đầu màu xanh lá cây với một số màu xanh lam trên vành tai và cổ họng Nó sinh sống ở vùng cây bụi và rừng ở độ cao 1600 m. Nó làm tổ trong một lỗ cây.', NULL, ' phía đông Nepal qua đông bắc Ấn Độ đến miền nam Thái Lan và Đông Dương', NULL, NULL, NULL, NULL, NULL, NULL, 'thainationalparks'),
(4213, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Psilopogon', NULL, 'GEN_1669', 'psilopogoncyanotis', 'Psilopogon cyanotis', '(Blyth, 1847) ', 'Cu rốc đầu đen ', 'SPA_04249', 'có bộ lông màu xanh lá cây và những đốm màu đỏ thẫm trên má. Cổ họng và tấm che tai của nó có màu xanh xanh.  Một dải màu đen chạy giữa cổ họng và ngực. Nó dài 16–17 cm (6,3–6,7 in).  Nó là một loài chim bụ bẫm, có cổ ngắn, đầu to và đuôi ngắn. Hóa đơn có màu tối. Con đực trưởng thành có trán màu đen. Con cái có đầu xỉn màu hơn với tông màu cam hơn ở các mảng phía trên và bên dưới vành tai, còn con non có đầu màu xanh lá cây với một số màu xanh lam trên vành tai và cổ họng.\nTiếng gọi lãnh thổ của con đực là tiếng ko-tek lớn lặp đi lặp lại . Các cuộc gọi khác bao gồm một tiếng còi huýt sáo . ', NULL, 'đông Nepal qua đông bắc Ấn Độ đến miền nam Thái Lan và Đông Dương', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4214, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Psilopogon', NULL, 'GEN_1669', 'psilopogonfaiostrictus', 'Psilopogon faiostrictus', '(Temminck, 1832).', 'Thầy chùa đầu xám', 'SPA_04250', '24,5-27cm. Chim trưởng thành giống Cu rốc bụng nâu, nhưng nhỏ hơn. Mỏ và da quanh mắt tối màu, có túm lông đỏ ở ngực. Các vùng rừng khác nhau, ở khu vực rừng thưa. Gặp lên độ cao khoảng 1.000 mét. Sinh sản vào thời gian tháng 2-5. Làm tổ ở hốc cây. ', NULL, ' Khắp các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(4215, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Psilopogon', NULL, 'GEN_1669', 'psilopogonfranklinii', 'Psilopogon franklinii', '(Blyth, 1842).', 'Cu rốc đầu vàng', 'SPA_04251', ' có màu xanh lá cây sống động ở trên với bộ lông màu xanh lục vàng nhạt hơn ở bên dưới, đôi cánh màu xanh đậm và xanh tươi bên dưới đuôi. Mỏ của nó có màu đen sẫm và xung quanh mắt có màu đen. Trán của nó có màu đỏ thẫm và cổ họng có màu cam. Chân của nó có màu xanh lục.\nNó dài 20,5-23,5 cm và nặng 50 - 101 g. Nó sinh sống ở các khu rừng ẩm nhiệt đới và cận nhiệt đới ở độ cao 900 đến 2700 m', NULL, '  Nepal, Ấn Độ, Bhutan, Myanmar, Thái Lan, Malaysia, Lào, Việt Nam và Trung Quốc đại lục', NULL, NULL, NULL, NULL, NULL, NULL, 'thainationalparks'),
(4216, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Psilopogon', NULL, 'GEN_1669', 'psilopogonhaemacephalus', 'Psilopogon haemacephalus', '(Dumont, CHF 1805).', 'Cu rốc cổ đỏ', 'SPA_04252', ' có màu xanh lá cây với đầu màu đỏ, má màu vàng và cổ họng màu vàng. Phần dưới của nó có sọc màu xám và đen.\nTrong mùa làm tổ, sự hao mòn của lông có thể khiến bộ lông ở lưng trên có màu hơi xanh.\nNó dài 15 - 17 cm và nặng 30 - 52,6 g. nó sinh sống trong các khu vườn, lùm cây và rừng cây thưa thớt. Môi trường sống có gỗ chết thích hợp cho việc đào tổ là rất quan trọng. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'thainationalparks'),
(4217, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Psilopogon', NULL, 'GEN_1669', 'psilopogonlagrandieri', 'Psilopogon lagrandieri', '(Verreaux, 1868)            ', 'Thầy chùa đít đỏ', 'SPA_04253', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4218, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Psilopogon', NULL, 'GEN_1669', 'psilopogonlineatus', 'Psilopogon lineatus', '(Vieillot, 1816)', 'Thầy chùa bụng nâu', 'SPA_04254', '29cm. Chim trưởng thành: Đầu, họng và ngực có vệt màu nâu nhạt. Phần trên cơ thể, cánh và đuôi xanh lá cây. Bụng dưới và lông bao dưới đuôi màu nâu vàng. Mỏ to, khỏe, màu nâu vàng, gốc mỏ có nhiều lông cứng đen. Da vòng quanh mắt vàng. Chân nâu vàng.  Rừng rụng lá (rừng khộp), nửa rụng lá, cây bụi ven biển và rừng trồng. Gặp lên đến độ cao khoảng 1.200 mét. Sinh sản vào khoảng tháng 9-5, đẻ 2-4 trứng.', NULL, 'Trung và Nam Trung Bộ, Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(4219, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Megalaimidae', 'Cu Rốc', 'FAM_234', 'Psilopogon', NULL, 'GEN_1669', 'psilopogonvirens', 'Psilopogon virens', '(Boddaert, 1783)            ', 'Cu rốc lớn', 'SPA_04255', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4220, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Blythipicus', NULL, 'GEN_0229', 'blythipicuspyrrhotis', 'Blythipicus pyrrhotis', '(Hodgson, 1837)            ', 'Gõ kiến nâu cổ đỏ ', 'SPA_04256', '30cm. Bộ lông màu nâu đỏ, kích thước lớn. Mỏ màu vàng nhạt. Chim mái có đầu màu nhạt hơn và không có màu đỏ thẫm ở hai bên cổ và gáy như chim đực sống: Các loại rừng gỗ và rừng tre nứa. Mùa sinh sản từ khoảng tháng 3-7, tổ làm trong hốc cây, không cao so với mặt đất, đẻ 2-4 trứng.', NULL, 'Khắp các vùng rừng trong cả nước. Độ cao phân bố lên tới khoảng 2.750 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4221, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Celeus', NULL, 'GEN_0337', 'celeusbrachyurus', 'Celeus brachyurus', '(Vieillot, 1818)            ', 'Gõ Kiến Nâu', 'SPA_04257', '25cm. Bộ lông màu nâu đỏ, mỏ đen. Chim mái có đầu màu nhạt hơn và không có đám lông đỏ ở má. Chủ yếu ăn kiến Sống ở các loại rừng thường xanh, cửa rừng, rừng thứ sinh và cây bụi. Sinh sản vào khoảng tháng 1-6, đẻ 2-3 trứng', NULL, 'Từ vùng Đông Bắc đến Nam Bộ ', NULL, NULL, 'Có giá trị nghiên cứu khoa học và góp phần điều hoà số lượng cá thể các quần thể con mồi, giúp cân bằng sinh thái tự nhiên', NULL, NULL, NULL, 'Birth of South East Asia'),
(4222, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Chrysocolaptes', NULL, 'GEN_0400', 'chrysocolaptesguttacristatus', 'Chrysocolaptes guttacristatus', '(Scopoli, 1786).', 'Gõ kiến vàng lớn', 'SPA_04258', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4223, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Chrysocolaptes', NULL, 'GEN_0400', 'chrysocolapteslucidus', 'Chrysocolaptes lucidus', '(Scopoli, 1786)            ', 'Gõ kiến vàng lớn', 'SPA_04259', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4224, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Chrysocolaptes', NULL, 'GEN_0400', 'chrysocolaptesvalidus', 'Chrysocolaptes validus', ' (Temminck, 1825)', 'Gõ kiến vàng', 'SPA_04260', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4225, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Chrysophlegma', NULL, 'GEN_0407', 'chrysophlegmaflavinucha', 'Chrysophlegma flavinucha', '(Gould, 1834)', 'Gõ kiến xanh gáy vàng', 'SPA_04261', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4226, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Dendrocopos', NULL, 'GEN_0559', 'dendrocoposatratus', 'Dendrocopos atratus', '(Blyth , 1849)', 'Gõ kiến nhỏ ngực đốm', 'SPA_04262', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4227, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Dendrocopos', NULL, 'GEN_0559', 'dendrocoposcanicapillus', 'Dendrocopos canicapillus', '(Blyth, 1845)            ', 'Gõ kiến nhỏ đầu xám ', 'SPA_04263', '15cm. Kích thước nhỏ so với các loài gõ kiến khác. Bộ lông màu đen và trắng. Phần dưới cơ thể có nhiều vạch đen nền trắng ngà. Chim trống có nhiều vạch đỏ nhỏ ở phía sau đỉnh đầu. Vai cánh màu đen khác Gõ kiến nhỏ sườn đỏ có vai cánh trắng. Dùng mỏ gõ vào thân và cành cây để tìm mồi sống: Sống ở các vùng rừng, vùng cây bụi thứ sinh và cây bụi vùng ven biển, gặp lên đến độ cao khoảng 1.800 mét. Sinh sản có thể từ tháng 12-4, làm tổ ở hốc cây, đẻ 3-5 trứng.', NULL, 'Khắp các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4228, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Dendrocopos', NULL, 'GEN_0559', 'dendrocoposhyperythrus', 'Dendrocopos hyperythrus', '(Vigors, 1831)', 'Gõ kiến nhỏ bụng hung', 'SPA_04264', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4229, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Dendrocopos', NULL, 'GEN_0559', 'dendrocoposmacei', 'Dendrocopos macei', '(Vieillot, 1818)', 'Gõ kiến nhỏ mày trắng', 'SPA_04265', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4230, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Dendrocopos', NULL, 'GEN_0559', 'dendrocoposmahrattensis', 'Dendrocopos mahrattensis', '(Latham, 1801)', 'Gõ kiến nhỏ trán vàng', 'SPA_04266', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4231, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Dendrocopos', NULL, 'GEN_0559', 'dendrocoposmajor', 'Dendrocopos major', '(Linnaeus, 1758)', 'Gõ kiến gáy đỏ ', 'SPA_04267', '24cm. Bộ lông chủ yếu có hai màu đen và trắng với hai mảng trắng lớn trên vai cánh. Thân dưới màu nâu nhạt, bụng dưới và bao dưới đuôi có màu đỏ. Chim trống có đỉnh đầu màu đen, gáy đỏ. Chim mái có đỉnh đầu đen tuyền và chim non có đỉnh đầu màu đỏ. sống: Rừng thường xanh. Sinh sản từ khoảng tháng 3-4, làm tổ ở hốc cây, đẻ 3 trứng.', NULL, ' Bắc Bộ. Phân bố ở độ cao trong khoảng từ 1.000 đến khoảng gần 2.750 mét. Loài gõ kiến lớn này phân bố ở Miến Điện, Thái Lan và Nam Đông Dương.', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4232, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Dinopium', NULL, 'GEN_0586', 'dinopiumjavanense', 'Dinopium javanense', '(Ljungh, 1797)            ', 'Gõ kiến vàng nhỏ', 'SPA_04268', 'Kích thước: 28-30 cm. Con đực có phần trên chủ yếu là màu vàng, mông màu đỏ thẫm, đỉnh đầu màu đỏ với mào nhọn, cổ sau màu đen, sọc mắt và dưới ria mép và phần dưới có vảy dày đặc ở ngực và dần dần khác biệt về phía lỗ huyệt. Con cái giống con đực nhưng có vương miện màu đen sọc trắng. Con non có ngực đen hơn và ít vảy hơn ở bụng dưới.  sống: Rìa rừng, sinh trưởng thứ sinh, vườn, công viên, rừng ngập mặn và khu vực nhiều cây cối rậm rạp.', NULL, ' Được tìm thấy từ tiểu lục địa Ấn Độ đến miền nam Trung Quốc và Đông Nam Á', NULL, NULL, NULL, NULL, NULL, NULL, 'Birds of Singapore'),
(4233, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Dryocopus', NULL, 'GEN_0613', 'dryocopusjavensis', 'Dryocopus javensis', '(Tristan, 1879).', 'Gõ kiến đen bụng trắng ', 'SPA_04269', 'Chim đực trưởng thành:Trán, đỉnh đầu và gáy đỏ tươi phần gốc các lông trắng. Nửa má dưới đỏ. Ngực dưới, bụng, sườn và nách trắng. Cằm: họng và trước cổ đen có chấm trắng. Ở phần gốc các lông cánh có vệt trắng lớn, mút lông cánh trắng. Một dải trắng ngang qua hông. Phần còn lại của bộ lông đen. Chim cái: Trán và phần trước đỉnh đầu đen, không có vệt đỏ ở má. Mắt trắng hay vàng nhạt. Mỏ xám chì, sống mỏ đen nhạt. Chân xám. Kích thước: Cánh: 197 - 224; đuôi: 136 - 151; giò: 33 - 34; mỏ: 44 - 50 mm. ', NULL, 'Việt Nam đã bắt được loài này ở Lâm Đồng, Ninh Thuận, Thủ Dầu Một, Tây Ninh và Đồng Nai. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4234, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Gecinulus', NULL, 'GEN_0744', 'gecinulusgrantia', 'Gecinulus grantia', '(McClelland, 1840)            ', 'Gõ kiến nâu đỏ', 'SPA_04270', '28cm. Bộ lông màu nâu đỏ. Đầu nâu sẫm, phía lưng màu hơi đỏ. Chim trống có mào đỏ. Khác biệt với Gõ kiến nâu cái bởi mỏ màu trắng nhạt và không có vằn trên lưng.', NULL, 'Khắp các vùng trong cả nước.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(4235, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Hemicircus', NULL, 'GEN_0847', 'hemicircuscanente', 'Hemicircus canente', '(Lesson, 1830)', 'Gõ kiến đen họng trắng', 'SPA_04271', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4236, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Hypopicus', NULL, 'GEN_0935', 'hypopicushyperythrus', 'Hypopicus hyperythrus', '(Vigors , 1831)', 'Gõ kiến nhỏ bụng hung', 'SPA_04272', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4237, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Jynx', NULL, 'GEN_0987', 'jynxtorquilla', 'Jynx torquilla', 'Linnaeus, 1758', 'Vẹo cổ', 'SPA_04273', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4238, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Meiglyptes', NULL, 'GEN_1190', 'meiglyptesjugularis', 'Meiglyptes jugularis', '(Blyth, 1845)', 'Gõ kiến đầu rắn', 'SPA_04274', 'chúng sở hữu hình dáng khá độc đáo với chiếc “bờm” lớn nằm trên đỉnh đầu trông như  chiếc vương miện, giúp tôn thêm dáng cho cơ thể vốn khá nhỏ nhắn của chúng. Chiếc đuôi ngắn kết hợp với cái mỏ nhọn kèm bộ lông màu nâu đen được phối thêm nhiều mảng trắng ở phần xương vai, cổ và lưng khiến loài chim này càng trở nên đặc biệt. Trong khi con cái sở hữu chiếc trán và đội “vương miện” màu trắng ngà thì màu đen lại là dấu hiệu giúp nhận diện ra con đực. thường làm tổ trong các hốc cây', NULL, ' được tìm thấy tại Campuchia, Lào, Myanma, Thái Lan và Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'Thiennhien.net'),
(4239, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Micropternus', NULL, 'GEN_1226', 'micropternusbrachyurus', 'Micropternus brachyurus', '(Vieillot, LJP 1818).', 'Gõ kiến nâu', 'SPA_04275', '25cm. Bộ lông màu nâu đỏ, mỏ đen. Chim mái có đầu màu nhạt hơn và không có đám lông đỏ ở má. Chủ yếu ăn kiến. Các loại rừng thường xanh, cửa rừng, rừng thứ sinh và cây bụi. Sinh sản vào khoảng tháng 1-6, sinh 2-3 trứng. Loài định cư. Tương đối phổ biến. Gặp lên tới độ cao khoảng 1.450 mét.', NULL, 'Từ vùng Đông Bắc đến Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Birdwatchingvietnam'),
(4240, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Misropternus', NULL, 'GEN_1239', 'misropternusbrachiurus', 'Misropternus brachiurus', '(Vieillot, LJP 1818).', 'Gõ kiến nâu', 'SPA_04276', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4241, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Mulleripicus', NULL, 'GEN_1258', 'mulleripicuspulverulentus', 'Mulleripicus pulverulentus', '(Temminck, 1826)', 'Gõ kiến xám', 'SPA_04277', 'Gõ kiến xám là loài có kích thước lớn nhất trong nhóm gõ kiến (khoảng 50 cm). Chim có phần lớn bộ lông màu xám nhạt với cổ dài màu hung, cánh và đuôi dài. Chim trống có mảng đỏ trên má trong khi đó chim mái không có. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnamwildlife'),
(4242, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Picoides', NULL, 'GEN_1557', 'picoidescanicapillus', 'Picoides canicapillus', '(Blyth, 1845). ', 'Gõ kiến nhỏ đầu xám', 'SPA_04278', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4243, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Picoides', NULL, 'GEN_1557', 'picoidescathpharius', 'Picoides cathpharius', '(Blyth, 1843).', 'Gõ kiến nhỏ ngực đỏ', 'SPA_04279', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4244, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Picoides', NULL, 'GEN_1557', 'picoidesmacei', 'Picoides macei', '(Vieillot, LJP 1818)', 'Gõ kiến nhỏ mày trắng', 'SPA_04280', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4245, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Picoides', NULL, 'GEN_1557', 'picoidesmajor', 'Picoides major', '(Linnaeus, 1758)', 'Gõ kiến nhỏ sườn đỏ', 'SPA_04281', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4246, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Picumnus', NULL, 'GEN_1558', 'picumnusinnominatus', 'Picumnus innominatus', 'Burton, 1836            ', 'Gõ kiến lùn đầu vàng', 'SPA_04282', '10cm. Kích thước rất nhỏ. Có nhiều vằn đen đậm trên nền màu kem ở phía bụng, mặt và đuôi có nhiều vạch đen trắng. Phía lưng có màu xanh ô liu sáng. Chim trống: Trước trán màu da cam sáng. Kiếm ăn ở tầng thấp trên các cây nhỏ. Dạn người, thường gặp kiếm ăn theo đàn chim hỗn hợp. Các loại rừng, vùng cây bụi thứ sinh và tre nứa. Gặp tới độ cao khoảng 1.800 mét. Sinh sản trong khoảng tháng 1-4, tổ làm trong hốc tre hay cây gỗ nhỏ, đẻ 2-4 trứng.', NULL, 'Bắc Bộ, Trung và Nam Trung Bộ, Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(4247, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Picus', NULL, 'GEN_1559', 'picuscanus', 'Picus canus', 'Gmelin, 1788            ', 'Gõ kiến xanh gáy đen', 'SPA_04283', '32cm. Kích thước tương đối lớn. Bộ lông màu xanh lục, hông màu vàng rất tương phản. Chim trống trán màu đỏ thẫm. Chim mái, trán thường có màu đen. Các vùng rừng cây gỗ thưa và rừng thông cổ thụ. Sinh sản vào khoảng tháng 4-6, tổ làm ở hốc cây, đẻ 4-5 trứng.', NULL, 'Từ Bắc Bộ đến Nam Bộ. Độ cao phân bố khoảng 2.100 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam'),
(4248, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Picus', NULL, 'GEN_1559', 'picuschlorolophus', 'Picus chlorolophus', 'Vieillot, 1818.', 'Gõ kiến xanh cánh đỏ', 'SPA_04284', 'loài này có một cái mỏ thẳng, một cái đuôi cứng để hỗ trợ nó bám vào thân cây, móng cong móc \"yoked\" bàn chân, với hai ngón chân trỏ về phía trước, và hai phía sau. nó có cái lưỡi dài có thể được phóng ngược về phía trước để bắt côn trùng . Có chiều dài khoảng 27 cm . Nó là một hình dạng chim gõ kiến tiêu biểu. phần trên lưng của nó là màu xanh lá cây ngoài các gáy sáng có chùm lông (tufted) màu vàng. cổ và ngực có màu xanh và bụng là màu trắng, với các chấm mịn màu xanh lá cây. cuối thân và đuôi màu đen. Chim trống trưởng thành có đầu màu xanh lá cây với một họng trắng. nó có màu đỏ ở trên mắt , phía trên gáy, và sọc đỏ hai bên cánh. chim mái chỉ có một miếng vá màu đỏ trên lông tai. chim non là giống chim mái , nhưng mờ nhạt.   Đây là một loài làm tổ trong một lỗ cây, và đẻ 2-4 trứng màu trắng.', NULL, ' vùng Nam và tây Nam, Tây nguyên miền nam châu Á từ Ấn Độ và Sri Lanka phía đông nam Trung Quốc và Sumatra.', NULL, NULL, NULL, NULL, NULL, NULL, 'Chimcanhviet'),
(4249, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Picus', NULL, 'GEN_1559', 'picuserythropygius', 'Picus erythropygius', '(Elliot , 1865)', 'Gõ kiến xanh hông đỏ', 'SPA_04285', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4250, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Picus', NULL, 'GEN_1559', 'picusflavinucha', 'Picus flavinucha', '(Gould, 1834)            ', 'Gõ kiến xanh gáy vàng ', 'SPA_04286', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4251, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Picus', NULL, 'GEN_1559', 'picusrabieri', 'Picus rabieri', 'Oustalet, 1898            ', 'Gõ kiến đầu đỏ', 'SPA_04287', ' 30cm. Bộ lông có màu xanh lá cây; gáy và vòng cổ màu đỏ. Chim trống đỉnh đầu đỏ, chim cái bộ lông có màu xanh lá cây. Mỏ đen, gốc dưới vàng. Ánh nắng xanh nhạt. sống: Các loại rừng thường xanh và vùng cây bụi thứ sinh. Gặp phải khoảng cách cao 700 mét. Sinh sản trong khoảng tháng 5-6.', NULL, 'Khu Bắc Bộ, Bắc và Trung Trung Bộ. Đã ghi nhận ở các tỉnh: Tuyên Quang, Yên Bái, Bắc Thái (cũ), Lạng Sơn, Ninh Bình, Thanh Hóa, Nghệ An, Hà Tĩnh, Quảng Trị, Thừa Thiên Huế, Gia Lai (rừng Kon Cha Răng). ', NULL, NULL, NULL, NULL, 'NT', NULL, 'Vietnam Bird Guide'),
(4252, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Picus', NULL, 'GEN_1559', 'picussp', 'Picus sp.', NULL, 'Gõ kiến?', 'SPA_04288', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4253, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Picus', NULL, 'GEN_1559', 'picusvittatus', 'Picus vittatus', '(Vieillot, 1818).', 'Gõ kiến xang bụng vàng', 'SPA_04289', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4254, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Picus', NULL, 'GEN_1559', 'picusxanthopygaeus', 'Picus xanthopygaeus', '(J. E. Gray & G. R. Gray , 1847)', 'Gõ kiến xanh bụng vằn', 'SPA_04290', 'Là loài chim gõ kiến ​​cỡ trung bình, màu xanh lá cây, có cổ họng có sọc và phần dưới có vảy màu trắng. Mặt trên màu xanh lá cây với phần mông hơi vàng, lông mao màu trắng và ria mép màu trắng và đen. Vương miện màu đỏ ở nam, đen ở nữ. Đuôi tối và trơn. Tờ tiền nhỏ, sẫm màu. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'thainationalparks'),
(4255, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PICIFORMES', 'GÕ KIẾN', 'ORD_066', 'Picidae', 'Gõ Kiến', 'FAM_287', 'Sasia', NULL, 'GEN_1775', 'sasiaochracea', 'Sasia ochracea', '(Hodgson, 1836)            ', 'Gõ kiến lùn mày trắng ', 'SPA_04291', 'có phần trên màu xanh ô liu nhuốm màu hạt dẻ và phát triển chiều dài lên tới 10 cm. Phần dưới có màu quế hoặc màu hung, đôi khi có màu hơi vàng ở hai bên sườn. Cái đuôi mập mạp có màu đen. có một vệt trắng phía trên và ngay sau mắt, phần sau được bao quanh bởi một vòng da trần màu hồng hoặc đỏ. Con đực có một mảng nhỏ màu vàng vàng trên trán mà con cái không có. Con non có màu xỉn hơn con trưởng thành, mặt trên xanh hơn và mặt dưới xám hơn. Mỏ màu xám, mống mắt màu đỏ và chân màu vàng hoặc cam, bàn chân chỉ có ba ngón chân (bốn ngón là tiêu chuẩn ở họ chim gõ kiến). Nhà của nó là rừng ẩm ướt hoặc khô rậm rạp với nhiều dây leo và tre, rừng cây bụi và đầm lầy. Nó được tìm thấy ở độ cao lên tới 2600 m. Nó thường kiếm ăn theo cặp hoặc có thể tham gia vào các đàn nhỏ gồm nhiều loài hỗn hợp, đôi khi lao xuống mặt đất, nơi nó có thể nhảy trong khoảng cách ngắn. Loài chim này dùng những mảnh tre để làm tổ. Nó dùng chân nhặt những mảnh tre gãy và dùng mỏ để nhổ những mảnh tre gãy một phần. Việc sinh sản diễn ra từ tháng 3 đến tháng 7.', NULL, ' từ miền bắc Ấn Độ, Nepal, Bhutan và Bangladesh qua miền nam Trung Quốc đến Myanmar, Lào, Việt Nam và Thái Lan', NULL, NULL, NULL, NULL, NULL, NULL, 'Thainationalparks'),
(4256, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PODICIPEDIFORMES', 'CHIM LẶN', 'ORD_067', 'Podicipedidae', 'Chim Lặn', 'FAM_299', 'Podiceps', NULL, 'GEN_1596', 'podicepsnigricollis', 'Podiceps nigricollis', '(Brehm, 1831).', 'Le hôi cổ đen', 'SPA_04292', 'Mô tả: 30cm. Là loài le nhỏ, bộ lông có hai màu đen và trắng. Hình thái giống loài Le hôi khi chúng xù lông nhưng tương phản giữa các màu rõ hơn. Trán dốc hơn, mỏ hơi vểnh lên. Trong mùa sinh sản: Lông vùng tai màu vàng nổi bật, cổ màu đen. Ngoài mùa sinh sản: Chỏm đầu màu đen kéo dài tới sau mắt.', NULL, 'Hiện trạng: Loài lang thang, không phổ biến.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/group/eared-grebe-458'),
(4257, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PODICIPEDIFORMES', 'CHIM LẶN', 'ORD_067', 'Podicipedidae', 'Chim Lặn', 'FAM_299', 'Podiceps', NULL, 'GEN_1596', 'podicepsruficollis', 'Podiceps ruficollis', '(Pallas, 1764)', 'Le hôi', 'SPA_04293', '25cm. Là loài chim nhỏ nhất trong họ Chim lặn, bơi giỏi như vịt. Khi bay thấy cánh đen có viền mảnh màu trắng. Trong mùa sinh sản: Vùng tai và cổ có màu hung nâu sẫm, góc mép mỏ có vệt vàng sang có thể nhìn thấy từ rất xa. Ngoài mùa sinh sản: Bộ lông màu nâu đến nâu sẫm (không bao giờ đen và trắng). Chim non: Đầu và cổ có sọc vằn. Tiếng kêu: Chủ yếu là tiếng ‘gừ, gừ’.', NULL, 'Bắc Bộ, Bắc Trung Bộ và Nam Trung Bộ, Tây Nguyên và Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/science-name/little-grebe-374'),
(4258, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PODICIPEDIFORMES', 'CHIM LẶN', 'ORD_067', 'Podicipedidae', 'Chim Lặn', 'FAM_299', 'Tachybaptus', NULL, 'GEN_1898', 'tachybaptusruficollis', 'Tachybaptus ruficollis', '(Pallas, 1764).', 'Le hôi', 'SPA_04294', '25cm. Là loài chim nhỏ nhất trong họ Chim lặn, bơi giỏi như vịt. Khi bay thấy cánh đen có viền mảnh màu trắng. Trong mùa sinh sản: Vùng tai và cổ có màu hung nâu sẫm, góc mép mỏ có vệt vàng sang có thể nhìn thấy từ rất xa. Ngoài mùa sinh sản: Bộ lông màu nâu đến nâu sẫm (không bao giờ đen và trắng). Chim non: Đầu và cổ có sọc vằn. Tiếng kêu: Chủ yếu là tiếng ‘gừ, gừ’. Các vùng đầm lầy, ao và hồ.', NULL, 'Bắc Bộ, Bắc Trung Bộ và Nam Trung Bộ, Tây Nguyên và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4259, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PROCELLARIIFORMES', 'HẢI ÂU', 'ORD_071', 'Procellariidae', 'Hải Âu', 'FAM_303', 'Calonectris', NULL, 'GEN_0293', 'calonectrisleucomelas', 'Calonectris leucomelas', '(Temminck, 1836)', 'Hải âu', 'SPA_04295', '48cm. Kích thước lớn, có màu xám và trắng, mặt và phía trước đầu có màu trắng nhạt, gáy màu tối và bờ mép cánh rộng màu sẫm tới tận phần dưới cánh màu trắng. Mỏ màu xanh nhạt, chóp mỏ màu tối. Chân và bàn chân màu hồng nhạt.', NULL, 'Vùng biển Trung Trung Bộ, Nam Trung Bộ và Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/science-name/streaked-shearwater-460'),
(4260, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PSITTACIFORMES', 'VẸT', 'ORD_072', 'Psittacidae', 'Vẹt', 'FAM_305', 'Loriculus', NULL, 'GEN_1109', 'loriculusvernalis', 'Loriculus vernalis', 'Sparrman, 1787            ', 'Vẹt lùn', 'SPA_04296', 'Vẹt lùn là loài có kích thước nhỏ nhất trong nhóm vẹt (khoảng 14 cm). Chim có vòng mắt trắng nổi bật trên bộ lông phần lớn màu xanh lá cây sáng, mỏ và lưng (đến tận lông bao đuôi trên) màu đỏ, chân màu vàng nhạt. Chim trống có một mảng xanh da trời nhạt trên cổ/ngực trên trong khi con mái không có. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnamwildlife'),
(4261, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PSITTACIFORMES', 'VẸT', 'ORD_072', 'Psittacidae', 'Vẹt', 'FAM_305', 'Psittacula', NULL, 'GEN_1670', 'psittaculaalexandri', 'Psittacula alexandri', '(Linnaeus, 1758)            ', 'Vẹt Ngực Đỏ', 'SPA_04297', 'Một dải hẹp đen bắt đầu từ trước trán kéo dài đến mép trước mắt, một dải đen khác rộng hơn bắt đầu từ gốc mỏ dưới kéo dài xuống hai bên cổ. Phần còn lại của đầu xám xanh, trước mắt và các lông ở quanh mắt phớt lục. Phần sau và hai bên cổ lục tươi. Lưng, vai, hông và trên đuôi lục hơi phớt vàng. Các lông đuôi giữa xanh nhạt tươi, các lông hai bên lục hơi phớt xanh, mút lông hơi vàng: Lông bao cánh vàng phớt lục. Lông cánh xanh với mép ngoài viền vàng hẹp và phiến lông trong đen nhạt viền vàng. Cằm trắng nhạt; họng và ngực hung đỏ. Bụng lục phớt xanh. Dưới đuôi lục phớt vàng. Cánh (đực): 162 - 174, (cái): 157 - 162; đuôi (đực): 168 - 189, (cái): 145 - 171; giò: 16 - 17; mỏ: 23 - 28mm Sống ở những chỗ có nhiều cây cao rậm rạp', NULL, 'Có ở khắp các vùng nhưng nhiều nhất là ở vùng trung du và vùng núi. Himalai, đông Ấn Độ, Miến Điện, Thái Lan, Nam Trung Quốc và Đông Dương', NULL, NULL, 'Có giá trị khoa học và thẩm mỹ. Tiếng hót hay. Là đối tượng nghiên cứu khoa học và giúp cân bằng sinh thái trong tự nhiên', NULL, NULL, NULL, 'VnCreature'),
(4262, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PSITTACIFORMES', 'VẸT', 'ORD_072', 'Psittacidae', 'Vẹt', 'FAM_305', 'Psittacula', NULL, 'GEN_1670', 'psittaculaeupatria', 'Psittacula eupatria', '(Linnaeus, 1766)', 'Vẹt má vàng', 'SPA_04298', 'có chiều dài từ đỉnh đầu đến chóp đuôi từ 56 đến 62 cm và nặng từ 200 đến 300 g. Đuôi có kích thước từ 28 đến 35 cm. Nó chủ yếu có màu xanh lá cây với ánh xanh xám nhạt trên má và gáy (sau cổ), bụng màu vàng lục, mảng đỏ trên vai và mỏ lớn màu đỏ với đầu màu vàng. Mặt trên của đuôi chuyển từ màu xanh lá cây ở phía trên sang màu xanh lam ở phía dưới và có màu vàng ở chóp. Mặt dưới của đuôi có màu vàng. Con đực trưởng thành có sọc đen dọc má dưới và dải màu hồng sau gáy. Con cái trưởng thành không có sọc đen ở má dưới và dải màu hồng trên gáy. Con non có ngoại hình tương tự con cái trưởng thành nhưng có đuôi ngắn hơn. sống trong rừng, đất rừng, đất nông nghiệp và rừng ngập mặn ở độ cao lên tới 900 m. Nó ăn nhiều loại hạt, chồi, quả và hạt hoang dã và được trồng. Đàn có thể gây thiệt hại lớn cho trái cây chín và cây ngũ cốc như ngô và jowar. Nó thường sống theo đàn nhỏ, nhưng hình thành các nhóm lớn hơn ở những khu vực có nhiều thức ăn hoặc ở các khu vực tập thể.  sinh sản từ tháng 11 đến tháng 4 ở phạm vi bản địa của chúng. Chúng thường làm tổ trong các hốc cây, nhưng đôi khi chúng cũng làm tổ trong các hốc cây do chúng tự đào hoặc các vết nứt trong các tòa nhà. Con cái đẻ 2 đến 4 quả trứng hình bầu dục, màu trắng, dài 27 đến 34 mm', NULL, '  Tây Ban Nha, Anh, Bỉ, Hà Lan, Đức, Thổ Nhĩ Kỳ, Ả Rập Saudi, Bahrain, Qatar, Các Tiểu vương quốc Ả Rập Thống nhất, Iran, Hồng Kông,  Sri Lanka, Việt Nam, Thái Lan, Mông Cổ ', NULL, NULL, NULL, NULL, NULL, NULL, 'thainationalparks'),
(4263, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PSITTACIFORMES', 'VẸT', 'ORD_072', 'Psittacidae', 'Vẹt', 'FAM_305', 'Psittacula', NULL, 'GEN_1670', 'psittaculafinschii', 'Psittacula finschii', '(Hume, 1874)', 'Vẹt đầu xám', 'SPA_04299', 'Chim đực trưởng thành: Toàn bộ đầu xám trừ các lông ở sau hàm dưới, cằm và họng đen nhạt. Phía sau cổ có một vòng xanh lục tươi. Mặt lưng lục hơi phớt vàng. Cánh lục, ở gần góc cánh có vệt đỏ. Các lông cánh sơ cấp đen nhạt phớt lục ở phiến lông ngoài và viền vàng ở phiến lông trong. Các lông đuôi giữa dài, màu xanh, phần mút đuôi vàng, các lông đuôi ở hai bên lục ở phiến lông ngoài và vàng ở phiến lông trong. Mặt bụng lục vàng.\nChim cái: Gần giống chim đực, nhưng không có vệt đỏ ở cánh.\nChim non: Gần giống chim cái, nhưng đầu ít màu xám và nhiều màu lục. Mắt trắng hay vàng nhạt. Mỏ trên đỏ tươi, mỏ dưới vàng. Chân lục xỉn.\nKích thước: Cánh: 138 - 157; đuôi: 185 - 2 99; giò: 13 - 14; mỏ: 21 - 22mm ', NULL, ' loài này có ở Bắc Thái, Hòa Bình, Lai Châu, Quảng Trị và Thừa Thiên. phân bố ở Axam, Miến Điện, Thái Lan và Đông Dương.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(4264, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PSITTACIFORMES', 'VẸT', 'ORD_072', 'Psittacidae', 'Vẹt', 'FAM_305', 'Psittacula', NULL, 'GEN_1670', 'psittaculahimalayana', 'Psittacula himalayana finschii', 'Hume, 1874', 'Vẹt đầu xám', 'SPA_04300', 'Chim đực trưởng thành: Toàn bộ đầu xám trừ các lông ở sau hàm dưới, cằm và họng đen nhạt. Phía sau cổ có một vòng xanh lục tươi. Mặt lưng lục hơi phớt vàng. Cánh lục, ở gần góc cánh có vệt đỏ. Các lông cánh sơ cấp đen nhạt phớt lục ở phiến lông ngoài và viền vàng ở phiến lông trong. Các lông đuôi giữa dài, màu xanh, phần mút đuôi vàng, các lông đuôi ở hai bên lục ở phiến lông ngoài và vàng ở phiến lông trong. Mặt bụng lục vàng.\nChim cái: Gần giống chim đực, nhưng không có vệt đỏ ở cánh.\nChim non: Gần giống chim cái, nhưng đầu ít màu xám và nhiều màu lục. Mắt trắng hay vàng nhạt. Mỏ trên đỏ tươi, mỏ dưới vàng. Chân lục xỉn.\nKích thước: Cánh: 138 - 157; đuôi: 185 - 2 99; giò: 13 - 14; mỏ: 21 - 22mm ', NULL, ' loài này có ở Bắc Thái, Hòa Bình, Lai Châu, Quảng Trị và Thừa Thiên. phân bố ở Axam, Miến Điện, Thái Lan và Đông Dương.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(4265, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PSITTACIFORMES', 'VẸT', 'ORD_072', 'Psittacidae', 'Vẹt', 'FAM_305', 'Psittacula', NULL, 'GEN_1670', 'psittaculalongicauda', 'Psittacula longicauda', 'Boddaert, 1783', 'Vẹt đuôi dài', 'SPA_04301', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4266, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'PSITTACIFORMES', 'VẸT', 'ORD_072', 'Psittacidae', 'Vẹt', 'FAM_305', 'Psittacula', NULL, 'GEN_1670', 'psittacularoseata', 'Psittacula roseata', 'Biswas, 1951            ', 'Vẹt đầu hồng', 'SPA_04302', '30-36cm. Chim trống trưởng thành: Đỉnh đầu và hai đầu hồng tươi, má và gáy hồng phớt bạc. Gốc hàm dưới, cằm, họng, và một dải ở dưới má đen kéo dài thành vòng ở hai bên và sau cổ. Phía lưng lục phớt vàng, đuôi xanh nhạt, ở bao cánh nhỡ có vệt đỏ. Phía bụng vàng lục nhạt. Chim mái: Đầu xám hồng viền vàng, không có vòng đen ở cổ.', NULL, 'Từ Bắc Trung Bộ đến Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(4267, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Caprimulgidae', 'Cú Muỗi', 'FAM_063', 'Caprimulgus', NULL, 'GEN_0310', 'caprimulgusaffinis', 'Caprimulgus affinis', '(Horsfield , 1821)', 'Cú muỗi lưng xám', 'SPA_04303', '25cm. Bộ lông màu nâu đậm và đầu có đốm. Chim trống có lông đuôi ngoài màu trắng (mút lông màu sẫm) và nhiều vệt trắng chạy ngang lông sơ cấp. Chim mái đuôi chỉ có một màu nâu, mà còn có nhiều vạt lông nâu sẫm chạy ngang lông sơ cấp. Tiếng kêu: ‘ch-uip’ lanh lảnh trong các khoảng ngắn. Kêu ‘chăngk’ khi bay vụt lên vào ban ngày.', NULL, 'Vùng Tây Bắc, Bắc Trung Bộ, Trung và Nam Trung Bộ, Nam Bộ. Gặp nhiều ở Đắc Lắc (1998).', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4268, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Caprimulgidae', 'Cú Muỗi', 'FAM_063', 'Caprimulgus', NULL, 'GEN_0310', 'caprimulgusasiaticus', 'Caprimulgus asiaticus', 'Latham , 1790', 'Cú muỗi á châu', 'SPA_04304', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4269, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Caprimulgidae', 'Cú Muỗi', 'FAM_063', 'Caprimulgus', NULL, 'GEN_0310', 'caprimulgusindicus', 'Caprimulgus indicus', 'Latham, 1790            ', 'Cú muỗi Ấn Độ', 'SPA_04305', 'Chim đực trưởng thành:\nMặt lưng lông lăn tăn xám nâu lẫn đen nhạt, giữa các lông có vạch đen dài, rộng hay hẹp tùy chỗ. Các lông ở giữa đỉnh đầu có vạch đen rộng tạo thành một vệt dọc rộng giữa đầu từ trán đến gáy, hai bên đỉnh đầu có vệt hẹp hơn, ở lưng và vai có các vạch rộng nhưng không tạo thành vệt dài. Các lông ở vai còn có vệt hung ở mút, các lông vai ngoài cùng có thêm điểm trắng phớt hung ở gần mút phiến ngoài, tạo thành hai dãy điểm đen và trắng hung ở hai bên vai.\nLông cánh sơ cấp đen nâu, mút lông lấm tấm nâu, lông ngoài cùng có vệt trắng ở giữa phiến lông trong, ba lông tiếp theo có vệt trắng ở cả hai phiến lông, phần gốc lông có lấm tấm và vằn hung. Lông cánh thứ cấp có vằn đen lẫn hung, mút lông lấm tấm nâu, phần lấm tấm này càng vào trong càng rộng dần, đến lông cánh tam cấp thì chiếm toàn bộ cả lông. Các lông đuôi giữa lấm tấm đen và nâu nhạt có vằn ngang đen hẹp, 4 đôi lông đuôi hai bên nó mút trắng viền den nhạt, phần trong đen có vằn lấm tấm nâu hay hung nâu.\nMột vệt trắng rộng ở họng, mút các lông viền đen và hung. Hai bên mép mỏ có dải trắng phớt hung kéo dài đến má. Cằm, ngực đen nhạt lấm tấm trắng nhạt phớt hung, càng về phía sau màu hung càng nhiều dần và tạo thành vằn ngang, thỉnh thoảng có đốm trắng hình mũi tên. Dưới đuôi hung có vằn ngang hẹp màu đen. Giò phủ lông một phần.\nChim cái:\nKhông có vệt trắng ở cuối lông đụôi, các vệt trắng ở cánh thay thế bằng vệt hung nhỏ. Nhìn chung cú muỗi Ấn Độ có bộ lông thẫm hơn cú muỗi đuôi dài.\nMắt nâu thẫm. Mỏ nâu hồng, mút mỏ đen nhạt. Chân nâu hồng hay hơi tím.', NULL, 'Loài cú muỗi này phân bố ở Nhật Bản, Triều Tiên, Mông cổ, đông Liên xô, Trung Quốc; mùa đông gặp ở Nam Trung Quốc, Ấn Độ, Thái Lan Đông Dương và Mã Lai.\n\nViệt Nam đã bắt được loài này ở Nghĩa Lộ, Sơn la và Hải Hưng.\n\n ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=7&loai=1&ID=5475'),
(4270, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Caprimulgidae', 'Cú Muỗi', 'FAM_063', 'Caprimulgus', NULL, 'GEN_0310', 'caprimulgusjokata', 'Caprimulgus jokata', 'Latham , 1790', 'Cú muỗi ấn độ', 'SPA_04306', 'Chim đực trưởng thành:\nMặt lưng lông lăn tăn xám nâu lẫn đen nhạt, giữa các lông có vạch đen dài, rộng hay hẹp tùy chỗ. Các lông ở giữa đỉnh đầu có vạch đen rộng tạo thành một vệt dọc rộng giữa đầu từ trán đến gáy, hai bên đỉnh đầu có vệt hẹp hơn, ở lưng và vai có các vạch rộng nhưng không tạo thành vệt dài. Các lông ở vai còn có vệt hung ở mút, các lông vai ngoài cùng có thêm điểm trắng phớt hung ở gần mút phiến ngoài, tạo thành hai dãy điểm đen và trắng hung ở hai bên vai.\nLông cánh sơ cấp đen nâu, mút lông lấm tấm nâu, lông ngoài cùng có vệt trắng ở giữa phiến lông trong, ba lông tiếp theo có vệt trắng ở cả hai phiến lông, phần gốc lông có lấm tấm và vằn hung. Lông cánh thứ cấp có vằn đen lẫn hung, mút lông lấm tấm nâu, phần lấm tấm này càng vào trong càng rộng dần, đến lông cánh tam cấp thì chiếm toàn bộ cả lông. Các lông đuôi giữa lấm tấm đen và nâu nhạt có vằn ngang đen hẹp, 4 đôi lông đuôi hai bên nó mút trắng viền den nhạt, phần trong đen có vằn lấm tấm nâu hay hung nâu.\nMột vệt trắng rộng ở họng, mút các lông viền đen và hung. Hai bên mép mỏ có dải trắng phớt hung kéo dài đến má. Cằm, ngực đen nhạt lấm tấm trắng nhạt phớt hung, càng về phía sau màu hung càng nhiều dần và tạo thành vằn ngang, thỉnh thoảng có đốm trắng hình mũi tên. Dưới đuôi hung có vằn ngang hẹp màu đen. Giò phủ lông một phần.\nChim cái:\nKhông có vệt trắng ở cuối lông đụôi, các vệt trắng ở cánh thay thế bằng vệt hung nhỏ. Nhìn chung cú muỗi Ấn Độ có bộ lông thẫm hơn cú muỗi đuôi dài.\nMắt nâu thẫm. Mỏ nâu hồng, mút mỏ đen nhạt. Chân nâu hồng hay hơi tím.\nKích thước:\nCánh: 189 - 208; đuôi: 130 - 150; giò:16; mỏ: 11mm. ', NULL, 'Việt Nam đã bắt được loài này ở Nghĩa Lộ, Sơn la và Hải Hưng. Loài cú muỗi này phân bố ở Nhật Bản, Triều Tiên, Mông cổ, đông Liên xô, Trung Quốc; mùa đông gặp ở Nam Trung Quốc, Ấn Độ, Thái Lan Đông Dương và Mã Lai.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4271, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Caprimulgidae', 'Cú Muỗi', 'FAM_063', 'Caprimulgus', NULL, 'GEN_0310', 'caprimulgusmacrurus', 'Caprimulgus macrous', '(Todd, 1920)', 'Cú muỗi đuôi dài', 'SPA_04307', 'Các lông mặt lưng lấm tấm nâu và hung nâu, nhìn chung có màu nâu nhạt; giữa đỉnh đầu và cả hai bên đầu có vạch dọc, rộng màu đen; một vài lông ở lưng có thân lông đen; phần dưới cổ có một vòng rộng lờ mờ không kín màu hung. Phiến ngoài lông vai có vệt đen nhung rộng viền hung, một vài lông trong cùng viền trắng. Lông bao cánh lấm tấm vằn nâu xám hung và đen, mút lông có vệt hung nhạt, giữa lông có vệt đen.\nĐuôi lấm tấm nâu và hung, giữa lông có những vệt đen rộng tạo thành vằn ngang khá rõ, hai đôi lông ngoài cùng có mút trắng phớt hung. Lông cánh sơ cấp đen nhạt, mút lông hung nâu nhạt, mép ngoài có vệt hung giữa lông có vệt trắng rộng, phía trong, các vệt hung hẹp và không rõ. Trước cổ có điểm trắng, mút và các lông này đen và hung. Cằm, h ọng và ngực hung nâu lấm tấm nâu. Bụng và dưới đuôi hung có vằn nâu hẹp; Giò phủ kín lông.', NULL, 'Ba Vì', NULL, NULL, NULL, NULL, NULL, NULL, 'Đỗ Tước và Đặng Thanh Long (2013). Chuyên đề điều tra đa dạng động vật rừng trên địa bàn thành phố Hà Nội. Chi Cục Kiểm lâm Hà Nội'),
(4272, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Caprimulgidae', 'Cú Muỗi', 'FAM_063', 'Eurostopodus', NULL, 'GEN_0697', 'eurostopodusmacrotis', 'Eurostopodus macrotis', '(Vigors, 1831)            ', 'Cú muỗi mào', 'SPA_04308', 'Đỉnh đầu hung lấm tấm đen rất mảnh, các lông giữa đỉnh đầu và gáy có điểm đen ở mút lông. Lông mào ở tai dài, đen, mút lông hung. Trước mắl, xung quanh mắt, tai, mặt và cằm đen nâu lấm tấm hung thẫm. Lưng trên đen có vằn hung thẫm hay hung nhạt. Lông vai hung nhạt, có vằn lăn tăn đen các lông vai trong cùng và ngoài cùng có vệt đen rộng gần mút rồi đến vệt hung thẫm viền đen ở mút.\nLưng dưới và trên đuôi hung nâu có vằn đen hẹp. Đuôi có vằn ngang rộng đen và lấm tấm đen xen kẽ nhau. Lông bao cánh hung nâu thẫm lấm tấm và vằn đen. Lông cánh đen nhạt có vằn lấm tấm hung nâu thẫm. Trước cổ có vòng trắng rộng. Ngực nâu đen có vằn hung nâu thẫm hẹp. Bụng, sườn và dưới đuôi có vằn đen nhặt và hung nâu nhạt xen kẽ.\nMắt nâu. Mỏ nâu hồng, mút mỏ và sống mỏ màu thẫm hơn. Chân nâu hồng. ', NULL, 'Hà Nội, Kontum (Đắc Tô) Thủ Dầu Một, Biên Hòa và Tây Ninh. Axam, Miến Điện, Thái Lan, Đông Dương và Mã Lai.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4273, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Caprimulgidae', 'Cú Muỗi', 'FAM_063', 'Lyncornis', NULL, 'GEN_1129', 'lyncornismacrotis', 'Lyncornis macrotis', '(Vigors, 1831)', 'Cú muỗi mào', 'SPA_04309', 'Đây là loài lớn nhất trong họ về chiều dài, có thể dao động từ 31 đến 41 cm. Con đực nặng trung bình 131 g và con cái nặng trung bình 151 g nên nó là loài nặng thứ hai trong họ sau loài diều hâu đêm nacunda. Môi trường sống tự nhiên của cú muỗi mào là rừng nhiệt đới vùng thấp nhiệt đới hoặc ẩm ướt. Giống như các loài chim ngủ khác, chúng hoạt động vào lúc hoàng hôn và ban đêm. Tổ là một cái nạo trên mặt đất và tổ gồm một quả trứng duy nhất. Gà con được ngụy trang khéo léo giữa đám lá rụng.', NULL, ' Loài này được tìm thấy ở Đông Nam Á với dân cư ở Tây Ghats và Sri Lanka, Bangladesh, Ấn Độ, Indonesia, Lào, Malaysia, Myanmar, Philippines, Thái Lan và Việt Nam. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Thainationalparks'),
(4274, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Strigidae', 'Cú Mèo', 'FAM_354', 'Asio', NULL, 'GEN_0172', 'asioflammeus', 'Asio flammeus', '(Pontoppidan, 1763)', 'Cú lửa', 'SPA_04310', ' 38cm. Chùm lông tai rất ngắn thường khó thấy khi quan sát ở thiên nhiên. Lông bao cánh có nhiều mảng màu tối. Mắt màu vàng chanh, kích thước nhỏ so với loài cú mèo. Đậu ở tư thế nằm ngang nhiều hơn so với các loài cú mèo. Cánh dài, đầu tròn, đuôi ngắn. Săn mồi ở tầm thấp trên mặt đất bằng cách bay lộn. Nhìn trong bóng tối giống một con bướm đêm khổng lồ. Phần lớn hoạt động vào ban đêm nhưng có thể gặp cả ban ngày. Thường bay vụt lên từ mặt đất. Thích vùng quang đãng. Tiếng kêu: To, chói tai khi bay, về mùa đông thường im lặng.', NULL, ' Vùng Đông Bắc và Trung Trung Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://birdwatchingvietnam.net/science-name/short-eared-owl-641'),
(4275, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Strigidae', 'Cú Mèo', 'FAM_354', 'Bubo', NULL, 'GEN_0257', 'bubonipalensis', 'Bubo nipalensis', 'Hodgson,1836', 'Dù dì nê pan', 'SPA_04311', 'Là một loài chim săn mồi cỡ lớn với vẻ ngoài đáng gờm. Nó có sự hiện diện của hai cấu trúc giống như \`sừng\` màu đen và trắng xiên ra bên ngoài hoặc búi tai. Bộ lông tổng thể của loài cú đại bàng bụng đốm này có màu nâu sẫm ở đầu, cánh trên và phần trên. Cổ họng và phần dưới có màu nâu nhạt. Phần trên có vạch và có đốm màu nâu nhạt. Hai bên sườn có sọc ngang màu đen và trắng. Ngực, bụng và đuôi có những đốm rộng màu nâu sẫm. Các chùm tai dài và xiên, có các lông có kích cỡ khác nhau. Đĩa mặt có màu nhạt. Chân và bàn chân có lông ngoại trừ các ngón cuối của ngón chân. Lỗ mũi tròn. Cái mỏ cong và có màu . vàng. Những móng vuốt cong dài có màu xám thép. Tròng đen có màu nâu sẫm. Những con non xanh xao hơn nhiều. có chiều dài khoảng 50 đến 65 cm và nặng 1,3 đến 1,7 Kg Mùa sinh sản của loài cú đại bàng bụng đốm là vào tháng 2 và tháng 3 ở vùng Himalaya. Ở Sri Lanka, mùa sinh sản là vào tháng 4 và tháng 5. Mùa đẻ là vào tháng 12 và tháng 1 ở miền nam Ấn Độ. Những loài cú bụng đốm này thường làm tổ trong các hốc cây lớn', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Indiabiodiversity'),
(4276, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Strigidae', 'Cú Mèo', 'FAM_354', 'Glaucidium', NULL, 'GEN_0762', 'glaucidiumbrodiei', 'Glaucidium brodiei', '(Burton, 1836)            ', 'Cú vọ mặt trắng', 'SPA_04312', '16cm. Kích thước nhỏ bé. Thường đậu trên cành cây. Trên gáy có mảng lông màu nâu sẫm và đen. Săn mồi cả ban ngày và đêm. Tiếng kêu: To, nghe được khoảng 4 nốt ‘hu hu-hu hu’, lặp đi lặp lại với nhiều đoạn cách quãng dài ngắn khác nhau. Tiếng kêu có khả năng thu hút một số loài chim khác bay đến, có thể bắt chước khi quan sát chim ở rừng.', NULL, 'Từ Bắc Bộ đến Nam Trung Bộ. Độ cao phân bố lên đến khoảng 3. mét.', NULL, NULL, NULL, NULL, NULL, NULL, 'Đỗ Tước và Đặng Thanh Long (2013). Chuyên đề điều tra đa dạng động vật rừng trên địa bàn thành phố Hà Nội. Chi Cục Kiểm lâm Hà Nộ'),
(4277, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Strigidae', 'Cú Mèo', 'FAM_354', 'Glaucidium', NULL, 'GEN_0762', 'glaucidiumcuculoides', 'Glaucidium cuculoides', '(Vigors, 1831)            ', 'Cú vọ', 'SPA_04313', '26cm. Loài cú mèo không có tai, mặt tròn, đậu ở tư thế nằm ngang nhiều hơn so với các loài cú mèo nhỏ khác. Phía lưng màu nâu với họa tiết ô vuông, đuôi màu nâu sẫm trông như một phần đính thêm vào. Mắt vàng. Săn mồi vào ban ngày sống: Rừng, rừng thứ sinh và thảm cây bụi. Sinh sản từ khoảng tháng 3-6. Đẻ 3-5 trứng.', NULL, 'Khắp các vùng trong cả nước. Có thể gặp lên tới độ cao khoảng gần 2.000 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4278, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Strigidae', 'Cú Mèo', 'FAM_354', 'Ketupa', NULL, 'GEN_0998', 'ketupaflavipes', 'Ketupa flavipes', '(Hodgson, 1836)            ', 'Dù dì hung', 'SPA_04314', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4279, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Strigidae', 'Cú Mèo', 'FAM_354', 'Ketupa', NULL, 'GEN_0998', 'ketupaketupu', 'Ketupa ketupu', '(Horsfield, 1821)', 'Du dì Kê-tu-pu', 'SPA_04315', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4280, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Strigidae', 'Cú Mèo', 'FAM_354', 'Ketupa', NULL, 'GEN_0998', 'ketupazeylonensis', 'Ketupa zeylonensis', '(Gmelin , 1788)', 'Dù dì phương đông', 'SPA_04316', 'Là loài cú mèo lớn, lông tai màu nâu hay nâu đỏ, có nhiều vệt đen ở phía lưng. Đôi khi có hai dải màu trắng to ở cánh. Không có đĩa mặt, tai cụp, đuôi màu đen nhìn thấy khi bay, chân không phủ lông. Mắt màu da cam. Phần lớn hoạt động vào ban đêm nhưng cũng có thể nhìn thấy vào ban ngày lúc trời nhiều mây. Sống thành đôi. Bay chậm và vừa bay vừa kêu. Khi bay, hai chân lúc lắc. ', NULL, 'Vùng Đông Bắc, Bắc Trung Bộ, Trung Trung Bộ và Nam Bộ. Phân bố có thể lên tới độ cao khoảng 900 mét. ', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(4281, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Strigidae', 'Cú Mèo', 'FAM_354', 'Ninox', NULL, 'GEN_1326', 'ninoxscutulata', 'Ninox scutulata', 'Raffles, 1822            ', 'Cú vọ lưng nâu', 'SPA_04317', '30cm. Loài cú mèo thân thon, đầu tròn, không có đĩa mặt. Phần dưới cơ thể có nhiều sọc rộng (đôi khi phần lớn là màu nâu đỏ ở ngực), đuôi dài có vằn. Mắt màu vàng đậm nổi bật. Hoạt động ban ngày sống: Rừng, kể cả rừng ngập mặn, và vùng đất trồng trọt. Sinh sản vào tháng 3-6. Làm tổ ở hốc cây, đẻ 2-5 trứng', NULL, 'Vùng Đông Bắc, Bắc Trung Bộ, Trung Trung Bộ và Nam Bộ. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4282, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Strigidae', 'Cú Mèo', 'FAM_354', 'Otus', NULL, 'GEN_1410', 'otusbakkamoena', 'Otus bakkamoena', 'Hodgson, 1836            ', 'Cú mèo khoang cổ', 'SPA_04318', '23cm. Bộ lông màu nâu đậm. Mắt Nâu (ít khi vàng), đây là đặc điểm khác với loài Cú mèo nhỏ. Chim không có nhiều màu nâu sẫm. Chỉ hoạt động ban đêm. Khi kêu là lúc đậu ở trên cao và có thể phát hiện bằng pin đèn lồng sáng. Điều này thường được hướng dẫn về ánh sáng và không gây sợ hãi cho người dùng. Tiếng kêu : \`hu-o\` nghe dịu dàng và thổ thức, nhắc đi nhắc lại mỗi lần cách nhau khoảng 10 giây. sống: Rừng, rừng thứ sinh và khu vực bản làng, nương rẫy. Sinh sản vào khoảng tháng 2-8. Thẻ 2-5.', NULL, ' Khắp các vùng trong cả nước ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4283, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Strigidae', 'Cú Mèo', 'FAM_354', 'Otus', NULL, 'GEN_1410', 'otuslempiji', 'Otus lempiji', '(Horsfield, 1821)', 'Cú mèo khoang cổ', 'SPA_04319', 'Bộ lông màu nâu xỉn xỉn màu và vòng cổ màu nâu nhạt nhạt quanh cổ. Phần dưới màu nâu với những vệt đen mờ. Đôi mắt màu nâu sẫm với mống mắt màu cam đậm. Trán và lông mày trắng nõn. Hai búi tai nổi bật. Rừng, Công viên & Vườn, Đô thị, Rừng ngập mặn', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'National Parks Board'),
(4284, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Strigidae', 'Cú Mèo', 'FAM_354', 'Otus', NULL, 'GEN_1410', 'otuslettia', 'Otus letia', '(Pennant, 1769)', 'Cú mèo khoang cổ', 'SPA_04320', 'Chim có hai tai dựng nhỏ, mắt to sáng, thân trên màu nâu với nhiều chấm nâu sáng và thân dưới nâu sáng với nhiều sọc nhỏ đậm. Chim trống và chim mái giống nhau nhưng chim mái thường có kích thước lớn hơn. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'vietnamwildlife'),
(4285, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Strigidae', 'Cú Mèo', 'FAM_354', 'Otus', NULL, 'GEN_1410', 'otusspilocephalus', 'Otus spilocephalus', '(Blyth, 1846)            ', 'Cú mèo', 'SPA_04321', 'Đĩa mặt hung nâu, các lông đều có vạch và vằn nâu thẫm. Vòng cổ trắng, mút lông nâu thẫm. Lông mặt bụng hung nâu, mỗi lông đều có vạch và lấm tấm có vằn. Lông mào tai có vằn rất rõ. Lông vai ngoài có vệt trắng lớn ở mút của phiến lông ngoài. Lông cánh hung nâu có vằn lấm tấm nâu thẫm, lông cánh sơ cấp có vằn trắng. Đuôi hung nâu có vằn nâu thẫm. Mặt bụng hung nâu, nhạt hơn mặt lưng, hai bên ngực, sườn có vằn lấm tấm dày nâu thẫm, vằn dưới đuôi thưa hơn. Mắt vàng. Mỏ vàng lục nhạt. Chân lục nhạt. Cánh: 138 - 142, đuôi: 65; giò: 25; mỏ: 12mm ', NULL, ' Đông nam Thái Lan và Nam Đông Dương', NULL, NULL, 'Có giá trị nghiên cứu khoa học và góp phần điều hoà số lượng cá thể các quần thể con mồi, giúp cân bằng sinh thái tự nhiên', NULL, NULL, NULL, 'VnCreature'),
(4286, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Strigidae', 'Cú Mèo', 'FAM_354', 'Otus', NULL, 'GEN_1410', 'otussunia', 'Otus sunia', 'Hodgson, 1836            ', 'Cú mèo nhỏ', 'SPA_04322', '19cm. Bộ lông đa dạng nhưng chủ yếu có hai màu lông: Màu xám và màu nâu đỏ. Thường đậu ở tư thế thẳng đứng, chùm lông tai chỉ dựng lên khi bị tác động. Phần lớn có dải trắng ở vai. Kích thước nhỏ hơn Cú mèo khoang cổ và sai khác bởi mắt màu vàng, không có khoang ở cổ và phần dưới cơ thể có vệt. Chỉ hoạt động vào ban đêm, ít khi nhìn thấy vào ban ngày, chim thường ngủ ở trong bọng cây hoặc tán lá rậm. Tiếng kêu: ‘toik, toik-ta-toik-túc, túc-tơ-túc’.', NULL, 'Từ Bắc Bộ đến Đông Nam Bộ.', NULL, NULL, NULL, NULL, NULL, NULL, 'birdwatchingvietnam.net'),
(4287, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Strigidae', 'Cú Mèo', 'FAM_354', 'Strix', NULL, 'GEN_1871', 'strixleptogrammica', 'Strix leptogrammica', 'Temminck, 1831', 'Hù', 'SPA_04323', 'g đĩa mặt màu nâu trâu có viền sẫm quanh mặt và mắt, lớp lông màu nâu sẫm, phần dưới da trâu có vạch màu nâu và ngực màu nâu sẫm. Con non có thân hình chủ yếu màu trắng ngà với đường viền sẫm màu quanh mắt. Rừng, bìa rừng hoặc bất kỳ khu vực rừng cây thích hợp nào.  Chế độ ăn bao gồm các loài gặm nhấm, thằn lằn, côn trùng lớn và chim.', NULL, ' Được tìm thấy từ tiểu lục địa Ấn Độ đến Trung Quốc, lục địa Đông Nam Á và Indonesia.', NULL, NULL, NULL, NULL, NULL, NULL, 'singaporebirds'),
(4288, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Tytonidae', 'Cú Lợn', 'FAM_386', 'Phodilus', NULL, 'GEN_1537', 'phodilusbadius', 'Phodilus badius', '(Horsfield, 1821)', 'Cú lợn rừng', 'SPA_04324', ' Đĩa mặt thon dài và có màu trắng-vinace, với một vùng rộng màu nâu hạt dẻ thẳng đứng qua mỗi mắt. Các lông của vành có màu hơi đen và nâu hạt dẻ. Trán có hình chữ V và có màu xám nâu nhạt, với phần trên của chữ \`V\` chạm tới đỉnh đầu, tạo cho tấm chắn phía trước có hình tam giác. Đôi mắt có màu nâu sẫm hoặc nâu đen và tương đối lớn. Mí mắt có màu trắng. Mỏ có màu vàng kem hoặc sừng hồng. gáy có màu hạt dẻ, lốm đốm các đốm đen và màu da bò. Lớp áo và lưng, tính đến tấm phủ đuôi trên, có màu hạt dẻ nhạt hơn, có các vệt trục màu đen và màu da bò, gốc lông có màu da bò sáng và mỗi lớp lông có 2-3 đốm đen trên trục. Đuôi màu hạt dẻ có vài vạch hẹp màu sẫm. Hai lông cánh chính bên ngoài (thứ 10 và thứ 9) có màu trắng ở màng ngoài và có viền màu đen hoặc hạt dẻ. Cổ họng có màu kem. Phần dưới có màu nâu vàng nhạt sống động, lốm đốm màu nâu đen và màu da bò. có lông ở khớp ngón chân với các lông màu hồng nhạt trở nên nhạt màu hơn ở gần khớp ngón chân. Các ngón chân có màu nâu vàng hoặc hơi hồng, các móng có màu nhạt hơn. Chiều dài 22,5-29cm. Chiều dài cánh 172-237mm. Chiều dài đuôi 168-239mm. Trọng lượng 255-308g. Con cái lớn hơn con đực một chút. loài chim sống về đêm, ban ngày đậu trong các hốc, hốc trên thân cây hoặc đậu trên cành được che chắn bởi lá cọ hoặc dưới một khúc mây dày nằm ngang, thường cao không quá 2 mét so với mặt nước. tầng rừng. Loài cú này không cảnh giác khi ngủ và rất dễ bị tiếp cận. Mùa sinh sản là từ tháng 3 đến tháng 5. Đẻ 3-5 quả trứng màu trắng.  Rừng nguyên sinh và thứ sinh rậm rạp thường xanh, đặc biệt là ở chân đồi, rừng dưới núi và rừng trên núi cao tới 1800m', NULL, ' Nepal, Sikkim, Assam, Nagaland, Manipur, Miến Điện và Thái Lan, từ đông sang nam Trung Quốc, phía nam qua bán đảo Mã Lai đến Greater Sundas. Cũng được ghi lại trên đảo Samar ở Philippines.', NULL, NULL, NULL, NULL, NULL, NULL, 'Owlpages'),
(4289, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Tytonidae', 'Cú Lợn', 'FAM_386', 'Tyto', NULL, 'GEN_2009', 'tytoalba', 'Tyto alba', '(Scopoli, 1769)            ', 'Cú lợn lưng xám', 'SPA_04325', '34cm. Đĩa mặt hình trái tim. Phía bụng trắng hoặc nâu sẫm. Phía lưng có màu xám với các vạch màu hung nâu đỏ. Mặt trên đuôi hung nâu đỏ với dải vằn ngang nâu tối. Mỏ phủ lông chỉ để lộ phần chóp mỏ; đùi và ống chân phủ kín lông. sống: Rừng, nơi có cây to, nguồn thức ăn dồi dào, trong thành phố và chùa chiền. Làm tổ tại đó, gặp trên vách tường, mái nhà. Đẻ 4-7 trứng.', NULL, 'Các vùng trong cả nước. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vietnam Bird Guide'),
(4290, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'STRIGIFORMES', 'CÚ', 'ORD_085', 'Tytonidae', 'Cú Lợn', 'FAM_386', 'Tyto', NULL, 'GEN_2009', 'tytocapensis', 'Tyto capaensis', '(Smith, 1834)', 'Cú lợn lưng nâu', 'SPA_04326', 'Kích thước và hình dáng giống loài Cú lợn lưng xám (Tyto alba) thường gặp rất phổ biến ở nước ta. Chiều dài thân khoảng 35cm. Có đĩa mặt trắng, nhưng màu lông trên lưng nâu tối, đuôi trắng có vằn ngang tối.', NULL, 'Ba Vì', NULL, NULL, 'Loài hiếm cùng với sự tồn tại của các vùng đồng cỏ hoang hoá là nơi cư trú của chúng. Đây là loài chim có lợi cho nông nghiệp vì thức ăn chính của chúng là các loài chuột, nhất là chuột đồng.', 'VU', NULL, NULL, 'Đỗ Tước và Đặng Thanh Long (2013). Chuyên đề điều tra đa dạng động vật rừng trên địa bàn thành phố Hà Nội. Chi Cục Kiểm lâm Hà Nội'),
(4291, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'SULIFORMES', 'CHIM ĐIÊN', 'ORD_087', 'Anhingidae', 'Cổ Rắn', 'FAM_021', 'Anhinga', NULL, 'GEN_0096', 'anhingamelanogaster', 'Anhinga melanogaster', 'Pennant, 1769', 'Cổ rắn phương Đông', 'SPA_04327', 'Chim trưởng thành: Một dải màu trắng kéo dài bắt đầu từ mắt chạy suốt bên cổ; cằm và họng màu trắng điểm lấm tấm nâu. Phần còn lại của đầu và cổ màu nâu, từng lông có vạch nhỏ nhạt hơn. Phần trên lưng màu đen nhạt, từng lông cũng có vạch nhạt hơn. Lưng dưới, hông, trên đuôi, đuôi và mặt dưới thân đen. Mặt lưng có ánh xanh. Phần vai, lông bao cánh và lông cánh thứ cấp cuối cùng màu đen, lông cánh sơ cấp và các lông cánh thứ cấp ngoài đen. Mắt trắng có viền vàng ở vành ngoài. Mỏ trên nâu sừng thẫm, mút đuôi nâu nhạt\n\nChim non: Đầu và cổ nâu nhạt, dải trắng ở cổ không rõ. Dưới lưng và trên đuôi nâu thẫm, các lông vai có viền hung, các vệt xám bạc không rõ. Mặt dưới thân nâu, mút đuôi nâu nhạt. Thức ăn chính là cá, tôm, đôi khi cả những loài lưỡng cư nhỏ như ngoé. Hình thức kiếm mồi cũng giống như những loài cốc. Làm tổ trong một số ít sân chim ở đồng bằng sông Cửu Long, tổ của chúng ở vị trí cao nhất so với tổ của các loài khác trong cùng địa điểm. Mùa sinh sản hàng năm từ tháng 5 - 8. Thời gian làm tổ từ 14 - 17 ngày . Đẻ 3 - 4 trứng, số ngày ấp trứng từ 25 - 27 ngày. Đời sống thường gắn liền với môi trường nước. Thường sống thành từng đôi ngay cả ngoài mùa sinh sản. Có tập tính kiếm ăn cùng với các loài cốc ở những bãi bồi ngập nước ven biển.', NULL, 'Gặp hầu khắp các tỉnh đồng bằng Nam Bộ, các sân chim thuộc các tỉnh Bạc Liêu, Cà Mau, Đồng Tháp, Cần Thơ, Vĩnh Long.  Ấn Độ, Mianma, Thái Lan, Lào, Cămpuchia, quần đảo Malaixia, Inđônêxia, Phipippin.', NULL, NULL, 'Là nguồn gen qúy, có giá trị khoa học cao.', 'VU', NULL, NULL, 'vncreatures.net'),
(4292, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'TROGONIFORMES', 'NUỐC', 'ORD_093', 'Trogonidae', 'Nuốc', 'FAM_379', 'Hapaetes', NULL, 'GEN_0816', 'harpacteserythrocephalus', 'Hapaetes erythrocephalus', '(Gould, J 1834).', 'Nuốc bụng đỏ', 'SPA_04328', '34cm. Bộ lông nhìn chung có màu nâu đỏ. Chim mái và chim đực đều có một hình lưỡi liềm trắng ở ngang trên ngực. Khi bay dễ thấy lông đuôi ngoài màu trắng. Chim trống: Đầu mỏ tối và phần thân dưới màu đỏ tươi. Có nhiều sọc lượn sóng màu xám ở lông bao cánh. Chim mái: Đầu và ngực trên có màu nâu nhạt. Có những vằn lượn sóng màu nâu sẫm ở lông bao cánh. Tiếng kêu: Giống tiếng kêu chim Vàng anh. Tiếng kêu được mô tả ở Thái Lan gồm 5 nốt (hoặc hơn) cách nhau, cất lên theo chuỗi thấp dần: ‘ti-aup ti-aup ti-aup…’', NULL, 'Khắp các vùng rừng trong cả nước. Độ cao phân bố trong khoảng 50-2.600 mét.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4293, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'TROGONIFORMES', 'NUỐC', 'ORD_093', 'Trogonidae', 'Nuốc', 'FAM_379', 'Harpactes', NULL, 'GEN_0821', 'harpactesoreskios', 'Harpactes oreskios', '(Temminck, 1823).', 'Nuốc bụng vàng', 'SPA_04329', '26,5-31,5cm. Khác Nuốc bụng đỏ chủ yếu ở chỗ bụng vàng; đầu, cổ và trước ngực có màu xám xanh.', NULL, 'Trung Bộ (trừ Trung Trung Bộ) và Nam Bộ. Tìm thấy ở nhiều nơi trong vùng phân bố như Hà Tĩnh, Đắc Lắc, Kon Tum.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4294, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'AVES', 'CHIM', 'CLA_04', 'TROGONIFORMES', 'NUỐC', 'ORD_093', 'Trogonidae', 'Nuốc', 'FAM_379', 'Harpactes', NULL, 'GEN_0821', 'harpacteswardi', 'Harpactes wardi', '(Kinnear, 1927)', 'Nuốc đuôi hồng', 'SPA_04330', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4295, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Bovidae', 'Trâu Bò', 'FAM_048', 'Bos', NULL, 'GEN_0237', 'bosbanteng', 'Bos banteng', 'Wagner, 1844', 'Bò rừng', 'SPA_04331', 'Thân cỡ lớn. Dài tới 2,25m, trọng lượng 600 - 800kg. Đầu nhỏ, trán không lõm sâu, đỉnh trán giữa hai sừng không tạo thành gờ cao, không có đám lông trắng bẩn. Da dưới cổ kéo dài thành yếm nhỏ giữa cổ và ngực. Sừng nhỏ hơn sừng Bò tót, gốc sừng hình trụ, chỏm sừng nhọn, uốn cong ra phía trước. Bộ lông ở lưng màu vàng tươi chuyển sang mầu xám đen ở con già. Bụng mầu sáng hơn. Phần mông có đám lông mầu trắng rất rõ. Bốn chân từ kheo trở xuống có mầu trắng. Đuôi khá dài, có lông rậm.', NULL, 'rong nước: Kontum, Đắk Lắk, Đồng Nai, Bình Phước', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5500'),
(4296, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Bovidae', 'Trâu Bò', 'FAM_048', 'Bos', NULL, 'GEN_0237', 'bosfrontalis', 'Bos frontalis', 'Lamber, 1804', 'Bò tót', 'SPA_04332', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4297, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Bovidae', 'Trâu Bò', 'FAM_048', 'Bos', NULL, 'GEN_0237', 'bosgaurus', 'Bos gaurus', 'Smith, 1827            ', 'Bò Tót', 'SPA_04333', 'Cỡ lớn trong bộ Ngón chẵn Artiodactyla, to, khoẻ. Thân dài 2,5 - 3 m. Trọng lượng 900 - 1000 kg. Đầu to, trán dẹt hơi lõm, có đốm lông trắng trên trán, đỉnh trán giữa hai sừng dô cao. Sừng to khoẻ cân đối, uốn cong lên phía trên tạo vòng cung hình bán nguyệt. Gốc sừng mầu vàng xám, mút sừng nhọn đen bóng. Lớp da ở cổ và trước ngực không tạo thành yếm. Bộ lông ngắn mềm mượt mầu nâu thẫm hoặc đen xám hơi phớt xanh bóng ở lưng. Lông ở bụng dài mầu nâu nhạt. Con cái thường có mầu hung đỏ. Mông đen, bốn chân từ khoeo trở xuống mầu trắng bẩn. Đuôi dài mầu đen. Thức ăn chủ yếu là cỏ, mầm lá non của lau sậy, chuối rừng, măng non tre nứa thuộc họ Cỏ Poaceae. Sinh sản thường vào tháng 6, 7. Mỗi năm đẻ 1 lứa , mỗi lứa 1 con. Thời gian có chửa 270 - 280 ngày. Nơi sinh sống của bò tót là rừng già thường xanh, rừng khộp, rừng hỗn giao tre nứa, rừng thứ sinh địa hình tương đối bằng ở độ cao 500 - 1500m so với mặt biển. Sống thành từng đàn 5 - 10 con (có đàn tới 20 - 30 con) đôi khi cũng gặp những cá thể sống đơn lẻ lẫn với đàn bò rừng. Hoạt động kiếm ăn ban ngày. Ban đêm nghỉ ngơi ở nơi quang đãng thoáng mát. Trong thiên nhiên hổ, báo, chó sói có thể tấn công đàn bò tót, khi bị tấn công cả đàn quây tròn bảo vệ con non, con già ở giữa.', NULL, 'Lai Châu, Sơn La, Thanh Hoá, Nghệ An, Hà Tĩnh, Quảng Bình, Quảng Trị, Thừa Thiên - Huế, Kontum, Gia Lai, Đắk Lắk, Lâm Đồng, Đồng Nai, Bình Phước. Ấn Độ, Nêpan, Mianma, Trung Quốc, Lào, Cămpuchia, Thái Lan, Malaixia.', NULL, NULL, 'Nguồn gen quý hiếm trong tự nhiên để có thể lai tạo với các giống bò khác tạo các giống cho năng suất thịt cao có sức chống chịu với bệnh tật và thời tiết khắc nghiệt. Làm thực phẩm, mỗi con cho khoảng 500 - 600kg. thịt, da cho công nghệ hàng da, sừng, xương làm hàng mỹ nghệ, trang trí.', 'EN', NULL, NULL, 'vncreatures.net'),
(4298, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Bovidae', 'Trâu Bò', 'FAM_048', 'Bos', NULL, 'GEN_0237', 'bosjavanicus', 'Bos javanicus', 'D\` Alton, 1823', 'Bò rừng', 'SPA_04334', 'Thân cỡ lớn. Dài tới 2,25m, trọng lượng 600 - 800kg. Đầu nhỏ, trán không lõm sâu, đỉnh trán giữa hai sừng không tạo thành gờ cao, không có đám lông trắng bẩn. Da dưới cổ kéo dài thành yếm nhỏ giữa cổ và ngực. Sừng nhỏ hơn sừng Bò tót, gốc sừng hình trụ, chỏm sừng nhọn, uốn cong ra phía trước. Bộ lông ở lưng màu vàng tươi chuyển sang mầu xám đen ở con già. Bụng mầu sáng hơn. Phần mông có đám lông mầu trắng rất rõ. Bốn chân từ kheo trở xuống có mầu trắng. Đuôi khá dài, có lông rậm. Thức ăn là cỏ, lá cây. Sinh sản vào tháng 6, 7. Thời gian có chửa 270 - 280 ngày. Mỗi năm đẻ 1 lứa, mỗi lứa 1 con. Thích sống ở những cánh rừng thưa thoáng mát, nhất là rừng khộp cây Họ: Dầu Dipterocarpacae, nơi ở thường là những khu rừng rậm rạp trong thung lũng. Những vùng núi cao, núi đá thường không thấy bò rừng. Bò rừng sống thành đàn từ 10 - 30 con. Hoạt động và kiếm ăn ban ngày. Do tập tính sống đàn mà ban đêm nghỉ ngơi chúng quây thành vòng tròn, con non, con già ở giữa, con tơ khỏe ở vòng ngoài bảo vệ chống kẻ thù tấn công.', NULL, 'Kontum, Đắk Lắk, Đồng Nai, Bình Phước. Mianma, Lào, Cămpuchia, Thái Lan, Malaixia, Inđônêxia', NULL, NULL, 'Loài quý hiếm của rừng nhiệt đới, có giá trị nghiên cứu khoa học. Góp phần điều hoà số lượng thực vật trong môi trường tự nhiên và cân bằng sinh thái.', 'EN', NULL, NULL, 'vncreatures.net'),
(4299, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Bovidae', 'Trâu Bò', 'FAM_048', 'Bubalus', NULL, 'GEN_0256', 'bubalusbubalis', 'Bubalus bubalis', 'Linnaeus,1758', 'Trâu rừng', 'SPA_04335', 'Hình dạng giống trâu nhà, nhưng to và khoẻ hơn. Thân dài tới 2,8 m. Trọng lương 800 - 1200kg. Đầu to, mõm ngắn, trán có lông dài rậm mầu xám đen, phía dưới cổ có đám lông trắng hình chữ V. Sừng dài, uốn cong hình lưỡi liềm, dài 1,4 - 2m, mặt cắt ngang gốc sừng hình tam giác. Thân sừng có nhiều vết nhăn nheo, mút sừng nhọn hướng về phía sau. Lưng mầu xám hoặc nâu xám. Đuôi ngắn có túm lông ở mút.', NULL, 'rong nước: Kontum, Đắk Lak.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=57&loai=1&img=1&ID=5504'),
(4300, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Bovidae', 'Trâu Bò', 'FAM_048', 'Capricornis', NULL, 'GEN_0309', 'capricornismaritimus', 'Capricornis maritimus', 'Heude, 1888', 'Sơn dương', 'SPA_04336', 'Sơn dương Đông Dương là loài thú cỡ lớn, con trưởng thành trên 150kg, toàn thân phủ lông dày, sừng ngắn (10–15 cm) cong về phía sau, đuôi rất ngắn. Có những cá thể có thể có trọng lượng 128 Kg được xác định theo kinh nghiệm của dân địa phương xem kích cỡ bộ da suy ra trọng lượng[3]. Nhiều con sơn dương đực to lớn như con hươu, còn con sơn dương đầu đàn thì cặp sừng đen nhánh, to lớn hơn con bê nhỡ', NULL, 'Ở Việt Nam phạm vi phân bố của chúng rất rộng, chúng từng phân bố từ biên giới giáp Trung Quốc tới tận nam Tây Nguyên, đổ dài từ các tỉnh phía Bắc như Sơn La, Cao Bằng, Lai Châu, Lạng Sơn đến các tỉnh miền Trung và Tây Nguyên, nơi cư trú của các tộc người Bahna, Jrai, Êđê, M\`nông, Xơ-đăng, Ca Dong ở các tỉnh Đắk Lắk, Gia Lai và Kon Tum, vùng rừng Lạc Dương (Lâm Đồng) từng được ghi nhận là thánh địa của loài linh dương, các tỉnh thuộc Tây Nguyên kể trên từng là vùng sơn lâm nhung nhúc bóng dáng các đàn sơn dương nhưng nay vô cùng hiếm thậm chí là không còn nữa', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/S%C6%A1n_d%C6%B0%C6%A1ng_%C4%90%C3%B4ng_D%C6%B0%C6%A1ng'),
(4301, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Bovidae', 'Trâu Bò', 'FAM_048', 'Capricornis', NULL, 'GEN_0309', 'capricornismilneedwardsii', 'Capricornis milneedwardsi', '(Hodgson, 1831)', 'Sơn dương', 'SPA_04337', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4302, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Bovidae', 'Trâu Bò', 'FAM_048', 'Capricornis', NULL, 'GEN_0309', 'capricornissumatraensis', 'Capricornis sumatraensis', '(Bechstein, 1799)            ', 'Sơn dương', 'SPA_04338', 'Cỡ lớn trọng họ Trâu bò Bovidae. Con trưởng thành nặng trên 150kg. Hình dáng gần giống nai, trên đỉnh đầu có đám lông dài tạo thành bờm, có những chùm lông dài phủ từ tai đến góc miệng. Cả đực và cái đều có sừng ngắn không dài quá 30cm., sừng hình ống hình tròn có nhiều nếp ngang úp vào xương sừng, mút sừng nhọn cong về phía sau. Sừng không phân nhánh. Toàn thân phủ lông dầy, dài, cứng mầu xám đen hoặc xám tro. Từ trán đến vai lông rất dài tạo thành bờm. Đuôi rất ngắn. Sơn dương kiếm ăn ở lưng chừng núi đá và cả trên đỉnh núi. Thức ăn là cỏ, lá cây, cành cây nhỏ, mầm cây, quả cây, rêu và địa y trên vách đá. Mùa sinh sản tập trung vào tháng 3 - 4, động dục ghép đôi vào tháng 8 - 10. Thời gian có chửa 210 - 240 ngày. Mỗi năm đẻ 1 lứa, mỗi lứa 1 con. Sơn dương sống ở những vùng rừng núi đá, chủ yếu là vùng núi đá vôi ở độ cao từ 50 - 2000m so với mặt biển. Nơi ở, trú ẩn thường là hang hốc đá. Hoạt động ban ngày từ 4, 5 giờ sáng đến 4, 5 giờ chiều. Vùng hoạt động cá thể không lớn và ổn định lâu dài nên dễ bị săn bắn và bẫy bắt. Sống thành từng nhóm 3 - 4 cá thể, con già thường sống đơn độc. Kẻ thù của Sơn dương (con non) là thú ăn thịt cỡ lớn: Hổ, Báo..', NULL, 'Sơn La, Cao Bằng, Lai Châu, Lạng Sơn, Hoà Bình, Quảng Ninh, Hải Phòng, Thanh Hoá, Nghệ An, Hà Tĩnh, Quảng Bình, Quảng Trị, Thừa Thiên - Huế, Quảng Nam, Kontum, Gia Lai, Đắk Lắk, Lâm Đồng. Ấn Độ (Assam), Mianma, nam Trung Quốc, Lào, Malaixia, Inđônêxia (Sumatra).', NULL, NULL, 'Loài thú thích nghi với sinh cảnh rùng núi đá là đối tượng phục vụ cho du lịch sinh thái. Có giá trị nghiên cứu khoa học và nuôi làm cảnh ở công viên, vườn thú.', 'EN', NULL, NULL, 'vncreatures.net'),
(4303, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Bovidae', 'Trâu Bò', 'FAM_048', 'Naemorhedus', NULL, 'GEN_1285', 'naemorhedusmilneedwardsii', 'Naemorhedus milneedwardsii', '(Heude, 1888)', 'Sơn dương ', 'SPA_04339', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4304, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Bovidae', 'Trâu Bò', 'FAM_048', 'Naemorhedus', NULL, 'GEN_1285', 'naemorhedussumatraensis', 'Naemorhedus sumatraensis', '(Bechstein, 1799)', 'Sơn dương', 'SPA_04340', 'Cỡ lớn trọng họ Trâu bò Bovidae. Con trưởng thành nặng trên 150kg. Hình dáng gần giống nai, trên đỉnh đầu có đám lông dài tạo thành bờm, có những chùm lông dài phủ từ tai đến góc miệng. Cả đực và cái đều có sừng ngắn không dài quá 30cm., sừng hình ống hình tròn có nhiều nếp ngang úp vào xương sừng, mút sừng nhọn cong về phía sau. Sừng không phân nhánh. Toàn thân phủ lông dầy, dài, cứng mầu xám đen hoặc xám tro. Từ trán đến vai lông rất dài tạo thành bờm. Đuôi rất ngắn.\nSinh học, sinh thái:\nSơn dương kiếm ăn ở lưng chừng núi đá và cả trên đỉnh núi. Thức ăn là cỏ, lá cây, cành cây nhỏ, mầm cây, quả cây, rêu và địa y trên vách đá. Mùa sinh sản tập trung vào tháng 3 - 4, động dục ghép đôi vào tháng 8 - 10. Thời gian có chửa 210 - 240 ngày. Mỗi năm đẻ 1 lứa, mỗi lứa 1 con. Sơn dương sống ở những vùng rừng núi đá, chủ yếu là vùng núi đá vôi ở độ cao từ 50 - 2000m so với mặt biển. Nơi ở, trú ẩn thường là hang hốc đá. Hoạt động ban ngày từ 4, 5 giờ sáng đến 4, 5 giờ chiều. Vùng hoạt động cá thể không lớn và ổn định lâu dài nên dễ bị săn bắn và bẫy bắt. Sống thành từng nhóm 3 - 4 cá thể, con già thường sống đơn độc. Kẻ thù của Sơn dương (con non) là thú ăn thịt cỡ lớn: Hổ, Báo..', NULL, 'Ba Vì', NULL, NULL, 'Loài thú thích nghi với sinh cảnh rùng núi đá là đối tượng phục vụ cho du lịch sinh thái. Có giá trị nghiên cứu khoa học và nuôi làm cảnh ở công viên, vườn thú.', 'VU', 'VU', NULL, 'vncreatures'),
(4305, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Bovidae', 'Trâu Bò', 'FAM_048', 'Pseudoryx', NULL, 'GEN_1663', 'pseudoryxnghetinhensis', 'Pseudoryx nghetinhensis', '(Dung et al., 1993)', 'Sao la', 'SPA_04341', 'Thân cỡ lớn, thân dài tới 1,3 - 1,5m, trọng lượng: 80 - 120kg. Đầu mầu nâu sẫm có những vạch trắng hoặc đen nhạt. Mặt nâu sẫm hay nâu đỏ nhạt, cả đực và cái đều có các sọc trắng ở trên và dưới mắt, nhiều vạch trắng ở cằm và cổ. Mặt sau tai mầu nâu, mặt trước tai mầu trắng nhạt, chóp tai có túm lông dài mầu trắng. Phần lưng mầu nâu hai bên sườn có vạch trắng nhạt phân cách lưng với các chân mầu đen nhạt. Bộ lông mềm mượt có các vòng xoáy ở giữa mũi, hai bên cổ và hai vai. Ngay trên móng guốc có vòng trắng ở cả 4 chân. Cả đực và cái đều có sừng. Sừng dài, gần như thẳng, không phân nhánh, mút sừng nhọn, nhẵn bóng, lõi sừng kéo dài tới mút sừng. Thức ăn chủ yếu là cỏ, lá cây rừng. Theo Đỗ Tước, Sao la non 7 - 8 tháng tuổi đã sử dụng 58 loài thực vật làm thức ăn. Về sinh sản của loài thú này còn ít được nghiên cứu. Nơi sinh sống là rừng nhiệt đới lá rộng thường xanh, rừng nguyên sinh hoặc đã bị khai thác nhẹ. Nơi ở và kiếm ăn thường là những nơi có nhiều lèn đá lởm chởm gần các sông suối ở độ cao 200 - 600m so với mặt biển và xa khu dân cư. Tập tính sinh sống của chúng còn chưa được nghiên cứu.', NULL, 'Nghệ An, Hà Tĩnh (Vườn quốc gia Vụ Quang), Quảng Trị, Thừa Thiên - Huế (Vườn quốc gia Bạch Mã).  Lào.', NULL, NULL, 'Loài thú mới phát hiện lần đầu tiên ở Việt Nam thuộc họ: Trâu bò Bovidae. Chúng thích nghi với các vùng rừng núi cao, là đối tượng phục vụ cho du lịch sinh thái.', 'EN', NULL, NULL, 'vncreatures'),
(4306, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Cervidae', 'Hươu Nai', 'FAM_069', 'Axis', NULL, 'GEN_0192', 'axisporcinus', 'Axis porcinus', '(Zimmermann, 1780)', 'Hươu vàng', 'SPA_04342', 'Cỡ trung bình trong bộ Ngón chẵn, thân dài khoảng 1,3-1,5m. Trọng lượng 50 - 60 kg. Bộ lông ngắn mền, mầu vàng hung hay vàng xám. Lông ở lưng dài thô nhưng không tạo thành bờm. Sừng nhỏ, mảnh ngắn, có 2-3 nhánh (hai nhánh phụ, một nhánh chính) nhỏ hơn sừng Nai, nhưng lớn và dài hơn sừng hoẵng. Đế sừng ngắn hơn đế sừng Hoẵng. Thức ăn là cỏ lá cây ở những khu vực ẩm ướt ven các đầm lầy, sông suối. Sinh sản của Hươu vàng ở Việt Nam còn chưa được nghiên cứu, theo tài liệu ở nước ngoài: chúng động dục và ghép đôi vào tháng 9, 10. Thời gian có chửa 8 tháng. Mỗi năm đẻ một lứa, mỗi lứa đẻ 1 con. Chúng sinh sống trong rừng thưa ven các sình lầy, sông suối, ở độ cao không quá 1000m so với mặt biển. Hoạt động kiếm ăn ban đêm, ban ngày nghỉ ngơi trong các lùm cây lau sậy rậm rạp hay đầm mình trong bùn nước. Sống đàn 20 - 30 con, có thể lẫn lộn với đàn Nai cà tông hoặc Nai. Kẻ thù tự nhiên của chúng có thể bị các loài thú ăn thịt lớn tấn công gây hại.', NULL, 'Kontum, Đắk Lắk, Lâm Đồng, Đồng Nai. Pakixtan, Nêpan, Xri Lanka, Trung Quốc, Mianma, Thái Lan, Cămpuchia.', NULL, NULL, 'Loài thú quý hiếm. Có thể thuần dưỡng nuôi trong các trang trại, trong gia đình (giống như nuôi Hươu sao) lấy nhung, thịt, xương, da hoặc nuôi bán tự nhiên trong các khu du lịch sinh thái để làm cảnh, giáo dục thiên nhiên.', 'EU', NULL, NULL, 'vncreatures.net'),
(4307, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Cervidae', 'Hươu Nai', 'FAM_069', 'Caninmuntiacus', NULL, 'GEN_0301', 'caninmuntiacustruongsonensis', 'Caninmuntiacus truongsonensis', '(Giao et al.,1997)', 'Mang Trường Sơn', 'SPA_04343', 'Thân hình giống hoẵng, nhưng nhỏ hơn hoẵng và gần như nhỏ nhất trong họ Hươu nai Cervidae, trọng lượng từ 14 - 20kg. Toàn thân phủ lớp lông mịn mầu vàng nâu hoặc vàng rỉ sắt. Bốn chân mảnh khảnh. Đuôi mập. Con đực có sừng ngắn không phân nhánh. Sọ hình dạng giống như sọ hoẵng, nhưng kích thước nhỏ hơn. Hố mắt và hố tuyến lệ tròn hơn. Cả đực và cái đều có răng nanh dài thò ra khỏi miệng. Thức ăn là cỏ, quả lá cây rừng. Sinh sản còn chưa được nghiên cứu. Sống trong rừng già ( nơi có số mẫu sọ được nghiên cứu nhiều là Bản A Ré, Ta Lư, Hiên, Quảng Nam chủ yếu là rừng già có tập đoàn cây ưu thế là: Lim xẹt, Kiền kiền, Chò, Trám, Nhội...). Nơi rừng thưa, ven nương rẫy, savan cỏ cây bụi không gặp chúng.', NULL, 'Quảng Nam (Hiên, Giăng, Phước Sơn) ', NULL, NULL, 'Loài thú mới cho khoa học có ý nghĩa bảo tồn nguồn gen. Có giá trị nghiên cứu khoa học và du lịch sinh thái.', 'DD', NULL, NULL, 'vncreatures.net'),
(4308, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Cervidae', 'Hươu Nai', 'FAM_069', 'Cervus', NULL, 'GEN_0348', 'cervusnippon', 'Cervus nippon', 'Temminck, 1838', 'Hươu Sao', 'SPA_04344', 'Cỡ trung bình. Trọng lượng cơ thể 60 - 80kg. Con đực có sừng 2 - 4 nhánh, nhỏ hơn sừng nai. Thân phủ lông ngắn, mịn, màu vàng hung, có 6 - 8 hàng chấm trắng (như sao) dọc theo hai bên thân. Có vệt lông mầu xám kéo dài từ gáy dọc theo sống lưng. Bụng màu vàng nhạt. Bốn chân thon nhỏ màu vàng xám. Đuôi ngắn, phía trên vàng xám, phía đuôi trắng, mút đuôi có túm lông trắng Thức ăn là cỏ, lá cây. Hiện đã thống kê được 75 loài cây làm thức ăn cho chúng, ưa thích nhất là các loại lá cây có nhựa mủ như: sung, ngái, mít... thuộc họ Dâu tằm Moraceae. Trong điều kiện nuôi dưỡng, hươu sao đẻ tập trung vào các tháng 3, 4, 5. Thời kỳ động dục tập trung vào tháng 8, 9. Thời gian có chửa 215 - 235 ngày. Mỗi năm đẻ 1 lứa, mỗi lứa đẻ 1 con. Thời gian nuôi con 3 - 4 tháng. Con đực cho nhung thường vào tháng 3 - 4 dương lịch hàng năm. Ngoài thiên nhiên hươu sao sống ở rừng thưa trên núi đất, ưa thích nơi khô ráo. Sống thành từng đàn, hiền lành và nhút nhát', NULL, 'rước đây có ở Cao Bằng, Bắc Kạn, Quảng Ninh, Hà Tây (Ba Vì), Thanh Hoá, Nghệ An, Hà Tĩnh. Hiện nay trong thiên nhiên hầu như không còn. Hươu sao đang được nuôi dưỡng ở: Hà Giang, Sơn La, Hà Tây, Vĩnh Phúc, Hải Phòng, Hà Nội (Vườn Thú), Ninh Bình, Nghệ An, Hà Tĩnh, Đắk Lắk, Bình Dương, Thành phố Hồ Chí Minh (Vườn Thú) Trung Quốc, Triều Tiên, Nhật Bản, Liên bang Nga', NULL, NULL, 'Nhung có hoạt tính sinh học cao dùng làm dược liệu rất có giá trị. Nghề nuôi hươu sao đang phát triển mạnh mang lại lợi ích kinh tế cao trong các hộ gia đình', 'EW', 'LC', NULL, NULL),
(4309, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Cervidae', 'Hươu Nai', 'FAM_069', 'Cervus', NULL, 'GEN_0348', 'cervusunicolor', 'Cervus unicolor', '(Kerr, 1792)', 'Nai', 'SPA_04345', 'Nai là loài lớn nhất trong  họ hươu nai Cervidae, nặng 150 - 200 kg, dài thân 1.800 - 2.000mm. Bộ lông dày, sợi lông nhỏ, dài, nâu ở hông và mông, xám hay xám đen ở lưng và ngực, trắng bẩn ở bụng và mặt trong các chi. Nai đực có sừng (gạc) ba nhánh. Nhánh thứ nhất tạo với nhánh chính một góc nhọn lớn. Sừng to, thô, nhiều nhánh và nhiều đốt sần. Nai sống nhiều sinh cảnh rừng: rừng thưa, rừng rụng lá,  rừng thứ sinh  ven trảng cỏ. Mật độ cao gặp ở các vùng rừng ven suối và đồi bát úp. Nai không sống ở độ cao trên 1.000m. Khu vực sống rộng 4 - 5 km2 và ổn định. Sống đàn hoặc đơn, kiếm ăn đêm. Nơi xa dân cư. Nai có thể kiếm ăn cả lúc sáng sớm và chiều tối. Nơi bị săn bắn mạnh Nai đi kiếm ăn muộn (23 - 24 giờ).\n\nNai ăn các loại cỏ, lá mầm,  cây bụi, cây tái sinh và một số loại quả rừng rụng xuống. trong điều kiện nuôi Nai ăn 20 - 25 kg cỏ, lá một ngày. Nai sinh sản tập trung vào mùa thu và mùa xuân. Mang thai khoảng 8 tháng. Mỗi năm đẻ một lứa, mỗi lứa đẻ 1 con. Nai con đẻ ra khoẻ, bú mẹ khoảng 6 tháng, trưởng thành sinh dục sau 2 năm tuổi.', NULL, 'Trước đây Nai gặp khắp các tỉnh có rừng, hiện nay chỉ còn dọc theo biên giới phía Tây, từ Tây bắc đến Đông nam bộ và còn nhiều ở VQG Cát Tiên  Đông nam Á, Trung Quốc, Assam, Nêpan, ấn Độ, Xây Lan, Mianma, Thái Lan, Lào, Campuchia, Malaixia, Xumatra, Java, Borneo, Philippines.', NULL, NULL, 'Loài thú có giá trị nghiên cứu khoa học và nuôi cảnh ở các công viên vườn thú.', NULL, NULL, NULL, 'vncreatures.net'),
(4310, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Cervidae', 'Hươu Nai', 'FAM_069', 'Megamuntiacus', NULL, 'GEN_1182', 'megamuntiacustruongsonensis', 'Megamuntiacus truongsonensis', '(Giao, Tuoc, Dung, Wikramanayake, Amato, Arctander & Mackinnon, 1997)', 'Mang trường sơn', 'SPA_04346', 'Đặc điểm nhận dạng:\n\nThân hình giống hoẵng, nhưng nhỏ hơn hoẵng và gần như nhỏ nhất trong họ Hươu nai Cervidae, trọng lượng từ 14 - 20kg. Toàn thân phủ lớp lông mịn mầu vàng nâu hoặc vàng rỉ sắt. Bốn chân mảnh khảnh. Đuôi mập. Con đực có sừng ngắn không phân nhánh. Sọ hình dạng giống như sọ hoẵng, nhưng kích thước nhỏ hơn. Hố mắt và hố tuyến lệ tròn hơn. Cả đực và cái đều có răng nanh dài thò ra khỏi miệng.\n\nSinh học, sinh thái:\n\nThức ăn là cỏ, quả lá cây rừng. Sinh sản còn chưa được nghiên cứu. Sống trong rừng già ( nơi có số mẫu sọ được nghiên cứu nhiều là Bản A Ré, Ta Lư, Hiên, Quảng Nam chủ yếu là rừng già có tập đoàn cây ưu thế là: Lim xẹt, Kiền kiền, Chò, Trám, Nhội...). Nơi rừng thưa, ven nương rẫy, savan cỏ cây bụi không gặp chúng.', NULL, 'Trong nước: Quảng Nam (Hiên, Giăng, Phước Sơn).', NULL, NULL, 'Loài thú mới cho khoa học có ý nghĩa bảo tồn nguồn gen. Có giá trị nghiên cứu khoa học và du lịch sinh thái.', 'DD', NULL, NULL, 'vncreatures'),
(4311, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Cervidae', 'Hươu Nai', 'FAM_069', 'Megamuntiacus', NULL, 'GEN_1182', 'megamuntiacusvuquangensis', 'Megamuntiacus vuquangensis', '(Do et al.,1994)', 'Mang lớn', 'SPA_04347', 'Là loài có kích thước trung bình trong họ Hươu nai Cervidae. Trọng lượng cơ thể khoảng 40 - 50kg. Mặt không có bờm hay túm lông trùm trước trán, lông có mầu vàng bóng với những sọc đen chạy dọc xuống đế gạc phía trong trán từ nhánh gạc nhỏ tới suốt tuyến trước trán. Tuyến trán nhô ra, dài khoảng 2 cm. với bờ mí gấp lên. Dọc tuyến trán có ít lông mịn mầu đen, hàng lông dài quanh tuyến đổ về phía sau. Tuyến lệ có dải lông mịn mầu sẫm. Thân phần lưng sẫm hơn phần bụng. Từ cổ xuống lưng có một sọc mầu sẫm. Túm lông đuôi mầu sẫm, mặt dưới đuôi mầu trắng. Con đực có sừng (gạc) khá lớn. Thức ăn chủ yếu là cỏ, lá cây. Chưa có dẫn liệu về sinh sản của Mang lớn. Sống trong rừng già, rừng thứ sinh, savan cỏ cây bụi. Hoạt động ban đêm, sống đơn lẻ, chỉ ghép đôi trong thời kỳ động dục.', NULL, 'Trong nước: Nghệ An, Hà Tĩnh, Quảng Bình, Quảng Trị, Thừa Thiên - Huế, Quảng Nam, Bình Định, Đăk Lắk, Lâm Đồng, Ninh Thuận. Thế giới: Lào.', NULL, NULL, 'Loài mới cho thế giới, phát hiện lần đầu tiên ở Việt Nam 1994. Loài quý hiếm có giá trị bảo tồn nguồn gen, đã được đưa vào Sách đỏ Việt Nam (2000).', 'VU', NULL, NULL, 'VnCreature'),
(4312, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Cervidae', 'Hươu Nai', 'FAM_069', 'Moschus', NULL, 'GEN_1255', 'moschusberezovski', 'Moschus berezovski', 'Flerov, 1929.', 'Hươu xạ', 'SPA_04348', 'Dạng ngoài hơi giống Cheo cheo nhưng lớn hơn nhiều, chân sau dài hơn chân trước 1/3 nên khi đứng sau cao, trước thấp, lưng gù. Đực, cái đều không có sừng, không tuyến trước ổ mắt. Trọng lượng 6 - 1kg. Bộ lông dầy; lông dài xấp xỉ 3cm, thô, hơi cứng, nhẹ, xốp, phần gốc thẳng màu trắng, phần trên uốn sóng và có băng màu nâu xám, vàng nhạt xen kẽ, tạo cho Bộ lông có màu nâu xám lấm tấm vàng rất đều; tứ chi có màu thẫm. Con đực có tuyến xạ nằm khoảng giữa rốn và cơ quan sinh dục; có răng nanh mọc dài ngoài mép.', NULL, 'Trong nước: Lạng Sơn, Cao Bằng, Bắc Kạn. Thế giới: Ấn Độ, Nêpan, Mianma, Mông Cổ, Trung Quốc, Nga (Sakhalin), Triều Tiên.', NULL, NULL, NULL, NULL, 'CR', NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5590'),
(4313, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Cervidae', 'Hươu Nai', 'FAM_069', 'Muntiacus', NULL, 'GEN_1259', 'muntiacusmuntjak', 'Muntiacus muntjak', '(Zimmermann, 1780)            ', 'Hoẵng', 'SPA_04349', 'Cỡ nhỏ, thân hình thon nhỏ, trọng lượng không quá 30kg. Bộ lông mầu vàng sẫm, bụng trắng giống như các phân loài hoẵng khác. Chỉ khác các phân loài hoẵng vó đen và hoẵng vó vàng là bốn chân mầu vàng, giữa hai móng guốc có vệt trắng rõ rệt. Đuôi ngắn. Phân loài Hoãng Nam bộ có những đặc điểm Sinh học - Sinh thái của loài. Thức ăn của chúng là lá cây, quả cây, cỏ...Mùa sinh sản vào hai thời kỳ trong năm, từ tháng 1- 3 và từ tháng 6 - 8. Thời gian có chửa: 180 - 200 ngày. Mỗi năm đẻ 1 lứa, mỗi lứa 1 con (rất ít trường hợp đẻ 2 con). Thường sống trong những cánh rừng thưa, rừng quanh nương rẫy, đồi cây, trảng cỏ cây bụi. Nơi ở quang đãng thoáng mát, khô ráo ven rừng và không cố định lâu dài. Hoạt động ban đêm từ chập tối đến gần sáng. Vùng hoạt động cá thể nhỏ 1 - 2km2. Sống đơn độc, chỉ ghép đôi trong thời kỳ động dục.', NULL, 'Trong nước: Kontum, Lâm Đồng (Vườn quốc gia Bidoup - Núi Bà), Đồng Nai (Vườn quốc gia Cát Tiên), Bình Phước (Vườn quốc gia Bù Gia mập). Thế giới: Lào, Cămpuchia.', NULL, NULL, 'Phân loài đặc hữu của Đông Dương. Hoẵng dễ nuôi, có thể thuần dưỡng chăn nuôi trong các vườn thú, vườn quốc gia, khu bảo tồn thiên nhiên và các khu du lịch sinh thái.', 'VU', NULL, NULL, 'VnCreature'),
(4314, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Cervidae', 'Hươu Nai', 'FAM_069', 'Muntiacus', NULL, 'GEN_1259', 'muntiacusvaginalis', 'Muntiacus vaginalis', '(Boddaert, 1785)            ', 'Hoẵng (Mang đỏ bắc)', 'SPA_04350', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4315, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Cervidae', 'Hươu Nai', 'FAM_069', 'Muntiacus', NULL, 'GEN_1259', 'muntiacusvuquangensis', 'Muntiacus vuquangensis', '(Tuoc, Dung, Dawson, Arctander, Mackinnon, 1994)', 'Mang lớn', 'SPA_04351', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4316, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Cervidae', 'Hươu Nai', 'FAM_069', 'Rucervus', NULL, 'GEN_1763', 'rucervuseldi', 'Rucervus eldi', 'M\`Clellan, 1842            ', 'Hươu cà tông', 'SPA_04352', 'Nai cà tông có hình dáng giống Nai, nhưng nhỏ hơn. Đầu và mặt thuôn dài, tai to tròn. Con đực có cặp sừng 4 - 5 nhánh, nhánh 1 hướng về phía trước tạo với thân sừng hình vòng cung ngay trên đỉnh đầu, các nhánh khác ở ngọn sừng xoè ra giống như bàn tay 3 - 4 ngón. Bộ lông mềm, lưng mầu hung đỏ hoặc vàng hung có hai hàng chấm mầu vàng nhạt chạy dọc lưng. Con đực lông ở cổ thưa, ở gáy dầy, dài rủ xuống hai bên cổ. Ngực, bụng, háng mầu trắng. Phía trong chân sau có vệt trắng nhạt chạy dài xuống dưới. Đuôi rất ngắn. Con non có các đốm trắng như sao ở mông. Thức ăn chủ yếu là cỏ, lá cây ...Thời kỳ sinh sản vào tháng 10, 11. Động dục ghép đôi vào tháng 3 - 4, thời gian có chửa khoảng 8 tháng. Mỗi năm đẻ một lứa, mỗi lứa 1 con. Sinh sống trong rừng thưa, rừng thứ sinh, rừng khộp có địa hình tương đối bằng ở độ cao 500 - 600m so với mặt biển. Chúng sống thành từng đàn nhỏ 5 - 10 con hoặc nhiều hơn. Hoạt động kiếm ăn ban đêm, nơi thoáng mát ven rừng cho đến sáng sớm, khi mặt trời mọc chúng tìm nơi trú ấn nghỉ ngơi trong các thung lũng rậm rạp.', NULL, ' Kontum, Đắk Lắk , Lâm Đồng. Đông bắc Ấn Độ, Mianma, Trung Quốc, Cămpuchia, Thái Lan.', NULL, NULL, 'Thú quý hiếm, loài có giá trị trong hệ sinh thái và giá trị nghiên cứu khoa học cũng như nuôi cảnh ở công viên, vườn thú..', 'EN', NULL, NULL, 'vncreatures'),
(4317, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Cervidae', 'Hươu Nai', 'FAM_069', 'Rucervus', NULL, 'GEN_1763', 'rucervusporcinus', 'Rucervus porcinus', 'Zimmermann, 1777', 'Hươu vàng', 'SPA_04353', 'Cỡ trung bình trong bộ Ngón chẵn, thân dài khoảng 1,3-1,5m. Trọng lượng 50 - 60 kg. Bộ lông ngắn mền, mầu vàng hung hay vàng xám. Lông ở lưng dài thô nhưng không tạo thành bờm. Sừng nhỏ, mảnh ngắn, có 2-3 nhánh (hai nhánh phụ, một nhánh chính) nhỏ hơn sừng Nai, nhưng lớn và dài hơn sừng hoẵng. Đế sừng ngắn hơn đế sừng Hoẵng.', NULL, 'ong nước: Kontum, Đắk Lắk, Lâm Đồng, Đồng Nai.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=6&loai=1&img=1&ID=5585'),
(4318, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Cervidae', 'Hươu Nai', 'FAM_069', 'Rusa', NULL, 'GEN_1764', 'rusaunicolor', 'Rusa unicolor', '(Kerr, 1792)            ', 'Nai', 'SPA_04354', 'Nai là loài lớn nhất trong  họ hươu nai, nặng 150 - 200 kg, dài thân 1.800 - 2.000mm. Bộ lông dày, sợi lông nhỏ, dài, nâu ở hông và mông, xám hay xám đen ở lưng và ngực, trắng bẩn ở bụng và mặt trong các chi. Nai đực có sừng (gạc) ba nhánh. Nhánh thứ nhất tạo với nhánh chính một góc nhọn lớn. Sừng to, thô, nhiều nhánh và nhiều đốt sần Nai sống nhiều sinh cảnh rừng: rừng thưa, rừng rụng lá,  rừng thứ sinh  ven trảng cỏ. Mật độ cao gặp ở các vùng rừng ven suối và đồi bát úp. Nai không sống ở độ cao trên 1.000m. Khu vực sống rộng 4 - 5 km2 và ổn định. Sống đàn hoặc đơn, kiếm ăn đêm. Nơi xa dân cư. Nai có thể kiếm ăn cả lúc sáng sớm và chiều tối. Nơi bị săn bắn mạnh Nai đi kiếm ăn muộn (23 - 24 giờ). Nai ăn các loại cỏ, lá mầm,  cây bụi, cây tái sinh và một số loại quả rừng rụng xuống. trong điều kiện nuôi Nai ăn 20 - 25 kg cỏ, lá một ngày. Nai sinh sản tập trung vào mùa thu và mùa xuân. Mang thai khoảng 8 tháng. Mỗi năm đẻ một lứa, mỗi lứa đẻ 1 con. Nai con đẻ ra khoẻ, bú mẹ khoảng 6 tháng, trưởng thành sinh dục sau 2 năm tuổi', NULL, 'Khắp các tỉnh có rừng, dọc theo biên giới phía Tây, từ Tây bắc đến Đông nam bộ   Đông nam Á, Trung Quốc, Assam, Nêpan, ấn Độ, Xây Lan, Mianma, Thái Lan, Lào, Campuchia, Malaixia, Xumatra, Java, Borneo, Philippines', NULL, NULL, 'Loài thú có giá trị nghiên cứu khoa học và nuôi cảnh ở các công viên vườn thú', NULL, NULL, NULL, NULL),
(4319, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Suidae', 'Lợn', 'FAM_357', 'Sus', NULL, 'GEN_1885', 'susbucculentus', 'Sus bucculentus', 'Heude, 1892', 'Lợn rừng Trường Sơn', 'SPA_04355', 'Vùng phía sau bả vai nổi lên thành một cái bướu và cổ ngắn và dày đến mức gần như bất động. Đầu của con vật rất lớn, chiếm tới 1/3 toàn bộ chiều dài cơ thể. Cấu trúc của đầu rất phù hợp cho việc đào bới. Đầu hoạt động như một cái cày, trong khi cơ cổ mạnh mẽ cho phép con vật xới một lượng đất đáng kể: nó có khả năng đào 8–10 cm (3,1–3,9 in) vào mặt đất đóng băng và có thể lật những tảng đá nặng 40–50 kg ( 88–110 lb). Đôi mắt nhỏ và sâu, tai dài và rộng. Loài này có răng nanh phát triển tốt nhô ra khỏi miệng của con đực trưởng thành. Các móng ở giữa lớn hơn và dài hơn các móng bên và có khả năng di chuyển nhanh. Con vật có thể chạy với tốc độ tối đa 40 km/h (25 mph) và nhảy ở độ cao 140–150 cm', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://animalia.bio/heudes-pig'),
(4320, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Suidae', 'Lợn', 'FAM_357', 'Sus', NULL, 'GEN_1885', 'susscrofa', 'Sus scrofa', 'Linnaeus, 1758', 'Lợn Rừng', 'SPA_04356', 'Lợn rừng nặng 40 - 200 kg, dài thân 1.350 - 1.500mm, dài đuôi 200 - 300mm. Thân ngắn, đầu lớn, ngực nở, phần mông nhỏ hơn phần đầu ngực. Bộ lông thô, cứng màu đen xám. Lông gáy dài, dày và rậm. Khi bị kích thích hàng lông này dựng lên trông con vật dữ tợn. Răng nanh thường phát triển to dài chìa ra ngoài môi. Lợn con có nhiều sọc vàng chạy dọc thân Lợn rừng sống trong tất cả các dạng sinh cảnh, từ rừng thứ sinh, rừng thưa, ven các nương rẫy... Không sống trên núi đá. Không có nơi ở cố định. Sống đàn 5 - 20 con, kiếm ăn đêm (từ chập tối đến gần sáng), ngày nghỉ trong các bụi rậm. Thích đằm mình trong vũng nước. Mùa đông lợn làm tổ để nằm. Lợn rừng ăn tạp gồm các loại củ, quả giàu tinh bột, các loại quả cây rừng, măng tre nứa, chuối và nhiều động vật (nhái, ngoé, giun đất, ong..). Lợn rừng sinh sản quanh năm, mang thai khoảng 4 tháng, đẻ mỗi năm một hoặc hai lứa, mỗi lứa 7 - 12 con. Lợn mẹ làm tổ đẻ rất chu đáo. Lợn con đẻ sau 30 phút có thể đi lại bình thường, một tuần sau có thể đi theo mẹ và trưởng thành sinh dục sau hai năm tuổi', NULL, 'châu Âu, châu Á, Bắc Phi. Lợn rừng có mặt khắp các tỉnh miền núi và trung du', NULL, NULL, 'Lợn rừng cho da lông, thực phẩm. Trong hoạt động kiếm ăn lợn rừng ủi đất làm cho đất tơi xốp, thoáng khí và hàng năm chúng thải ra cho đất rừng một lượng lớn phân và nước giải. Tuy nhiên lợn rừng cũng gây một số tác hại cho hoa màu lương thực trên nương rẫy, phá hoại măng tre nứa', NULL, NULL, NULL, NULL),
(4321, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Tragulidae', 'Cheo Cheo', 'FAM_376', 'Tragulus', NULL, 'GEN_1974', 'tragulusjavanicus', 'Tragulus javanicus', '(Osbeck, 1765)', 'Cheo cheo', 'SPA_04357', 'Loài thú móng guốc nhỏ nhất trong họ Cheo cheo Tragulidae, thân dài khoảng 0,4 - 0,5m; trọng lượng trung bình 1300 - 2300g. Dạng ngoài hơi giống hoẵng. Đực, cái đều không có sừng, không có tuyến trước ổ mắt, răng nanh mọc dài ngoài mép (đực dài hơn), thiếu răng cửa trên. Chi rất mảnh, ngón 3, 4 phát triển. Bộ lông ngắn, mịn, đồng màu nâu đỏ ở mặt trên và mặt bên, thẫm ở dọc giữa lưng, nhạt dần ở hai bên, dọc gáy có vệt lông đen. Dưới cằm và họng có 2 vệt trắng chung gốc, 1 vệt dọc giữa tự do; đuôi lông xù, mặt trên màu giống lưng, mặt dưới trắng nhạt. Cheo ăn lá, chồi, thân non, hoa, quả, hạt, củ, cỏ, nấm. Thức ăn ưa thích là quả. Cheo cũng ăn côn trùng (sâu, nhộng), xác động vật. Cheo ghép đôi vào tháng 9 - 12 hàng năm, đẻ từ tháng 1 - 9, đẻ nhiều vào tháng 5-7. Theo A. Asdell (1946) và Grasse, (1955) Cheo cheo mang thai 120 ngày, năm đẻ 1 lứa/1 con.Cheo ưa sống đơn độc, chỉ ghép đôi thời kỳ động dục, hay ở rừng thưa, cũng có ở rừng già, ưa nơi bằng phẳng, khô ráo, có nhiều bụi rậm và có tầng cỏ quyết phát triển, trú ngụ trong các gốc cây to, bụi rậm. Hoạt động chủ yếu về đêm, từ 19h - 23h, mạnh nhất 20h - 22h. Nơi vắng cũng có thể gặp Cheo vào buổi sáng (5h - 7h).', NULL, 'Trong nước: Lạng Sơn, Vĩnh Phú, Thanh Hóa, Nghệ An, Hà Tĩnh, Quảng Bình, Quảng Trị, Thừa Thiên - Huế, Gia Lai, Kontum, Đắk Lắk, Lâm Đồng, Đồng Nai, Tây Ninh. Thế giới: Ấn Độ, Nam Mianma, Thái Lan, Lào, Cămpuchia, Malaixia, Inđônêxia (Sumatra, Java, Borneo)', NULL, NULL, 'Cheo là loài thú hiếm, dễ nuôi làm cảnh, nuôi ở các vườn thú, về khoa học, Cheo là loài thú Móng guốc cổ nhất, chỉ còn tồn tại ở rừng nhiệt đới Đông nam châu Á.', 'VU', 'DD', NULL, 'VnCreature'),
(4322, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ARTIODACTYLA', 'GUỐC CHẴN', 'ORD_008', 'Tragulidae', 'Cheo Cheo', 'FAM_376', 'Tragulus', NULL, 'GEN_1974', 'traguluskanchil', 'Tragulus kanchil', '(Raffles, 1821)', 'Cheo cheo kanchil', 'SPA_04358', 'Loài thú móng guốc nhỏ nhất trong họ Cheo cheo Tragulidae, thân dài khoảng 0,4 - 0,5m; trọng lượng trung bình 1300 - 2300g. Dạng ngoài hơi giống hoẵng. Đực, cái đều không có sừng, không có tuyến trước ổ mắt, răng nanh mọc dài ngoài mép (đực dài hơn), thiếu răng cửa trên. Chi rất mảnh, ngón 3, 4 phát triển. Bộ lông ngắn, mịn, đồng màu nâu đỏ ở mặt trên và mặt bên, thẫm ở dọc giữa lưng, nhạt dần ở hai bên, dọc gáy có vệt lông đen. Dưới cằm và họng có 2 vệt trắng chung gốc, 1 vệt dọc giữa tự do; đuôi lông xù, mặt trên màu giống lưng, mặt dưới trắng nhạt. Cheo ăn lá, chồi, thân non, hoa, quả, hạt, củ, cỏ, nấm. Thức ăn ưa thích là quả. Cheo cũng ăn côn trùng (sâu, nhộng), xác động vật. Cheo ghép đôi vào tháng 9 - 12 hàng năm, đẻ từ tháng 1 - 9, đẻ nhiều vào tháng 5-7. Theo A. Asdell (1946) và Grasse, (1955) Cheo cheo mang thai 120 ngày, năm đẻ 1 lứa/1 con.Cheo ưa sống đơn độc, chỉ ghép đôi thời kỳ động dục, hay ở rừng thưa, cũng có ở rừng già, ưa nơi bằng phẳng, khô ráo, có nhiều bụi rậm và có tầng cỏ quyết phát triển, trú ngụ trong các gốc cây to, bụi rậm. Hoạt động chủ yếu về đêm, từ 19h - 23h, mạnh nhất 20h - 22h. Nơi vắng cũng có thể gặp Cheo vào buổi sáng (5h - 7h).', NULL, 'Lạng Sơn, Vĩnh Phú, Thanh Hóa, Nghệ An, Hà Tĩnh, Quảng Bình, Quảng Trị, Thừa Thiên - Huế, Gia Lai, Kontum, Đắk Lắk, Lâm Đồng, Đồng Nai, Tây Ninh. Ấn Độ, Nam Mianma, Thái Lan, Lào, Cămpuchia, Malaixia, Inđônêxia (Sumatra, Java, Borneo)', NULL, NULL, 'Cheo là loài thú hiếm, dễ nuôi làm cảnh, nuôi ở các vườn thú, về khoa học, Cheo là loài thú Móng guốc cổ nhất, chỉ còn tồn tại ở rừng nhiệt đới Đông nam châu Á.', 'VU', NULL, NULL, 'vncreatures'),
(4323, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Canidae', 'Chó', 'FAM_061', 'Canis', NULL, 'GEN_0302', 'canisaureus', 'Canis aureus', 'Linnaeus, 1758', 'Chó rừng', 'SPA_04359', 'Nhỏ hơn chó sói lửa, nặng 5 - 8kg, dài thân 600 - 750mm, dài đuôi 200 - 250mm, dài bàn chân sau 135mm, trọng lượng 6 - 7 kgnền lông màu hung vàng có mút lông đen hoặc hung đen tạo thành màu hung nâu xám. Vùng vai có nhiều sợi lông đen. Khoảng một phần ba đuôi ngoài xám đen. Dài đuôi ngắn hơn nửa dài thân Chó sói vàng thường sống ở các khu rừng ven nương rẫy, có thể gần các trạng trại hay khu dân cư trong rừng. Sống đơn hay sống đôi, kiếm ăn đêm. Khác Chó sói lửa, Chó sói vàng khá bạo dạn, chúng có thể vào tận nơi ở trong rừng của con người khi họ đã đi ngủ để kiếm ăn. Thức ăn của chúng là thú nhỏ, Chim, bò sát, ếch nhái. Ở Thái Lan theo B.lekagul, 1988 Chó rừng thường theo Hổ để ăn các mẩu thịt Hổ để lại.', NULL, 'Ở nước ta mới gặp loài thú thuộc họ Chó Canidae này ở Tây Nguyên (Gia Lai, Kontum). Lần đầu tiên đã tìm thấy loài này ở Đắc Lắc. Loài này có ở các nước châu Âu, châu Á và châu Phi. ', NULL, NULL, 'Loài hiếm có giá trị khoa học và nguồn gen. Chó rừng là loài hiếm từ trước đền nay, là nguồn gen tự nhiên quý. Do nạn săn bắt, chặt phá rừng, chó rừng ngày càng trở nên hiếm', NULL, NULL, NULL, 'vncreatures.net'),
(4324, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Canidae', 'Chó', 'FAM_061', 'Cuon', NULL, 'GEN_0506', 'cuonalpinus', 'Cuon alpinus', '(Pallas, 1811)            ', 'Chó sói đỏ', 'SPA_04360', 'Thú cỡ lớn. Dài thân: 895 - 918mm, dài đuôi: 308 - 327mm, dài bàn chân sau: 125 - 167mm. Mõm ngắn mùa đen. Tai tròn vểnh. Bộ lông màu da hoẵng (vàng đỏ). Bụng màu sáng nhợt. Chân và đuôi chuyển sang nâu đen và đen. Gốc đôi thắt nhỏ, xù ở phần cuối. Sống ở rừng, thường cư trú và hoạt động ở rừng già, những lúc săn đuổi mồi có thể về gần bản làng. Sói đỏ là thú ăn đêm, nhưng hoạt động tích cực vào lúc sáng sớm và chiều tối (có khi cả ban ngày), vùng hoạt động lớn và luôn thay đổi. Sống từng đôi hoặc đàn 5 - 7 con, khi săn mồi có thể nhập đàn 10 - 15 con. Thức ăn của sói đỏ là nai, hoẵng, lợn rừng, động vật nuôi và các loài chim lớn. Sinh sản hầu như quanh năm, nhưng tập chung nhất là vào các tháng 11 - 2. Thời gian có chửa khoảng 9 tuần. Mỗi lứa đẻ 4 - 6 con, có thể 10 - 11 con', NULL, 'Việt Nam: Lai Châu, Lào Cai (Sapa), Bắc Thái, Sơn La (Mộc Châu), Gia Lai, Kontum, Đắc Lắc. Sói đỏ có phân bố rộng ở các tỉnh miền núi Thế giới: Liên xô (cũ), Nêpan, Ấn Độ, Mianma, Trung Quốc, Triều Tiên, Thái Lan, Lào, Campuchia, Malaixia, Xumatơra, Giava, Inđônnêxia.', NULL, NULL, NULL, 'EN', 'EN', NULL, 'VnCreature'),
(4325, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Canidae', 'Chó', 'FAM_061', 'Nyctereutes', NULL, 'GEN_1341', 'nyctereutesprocyonoides', 'Nyctereutes procyonoides', '(Gray, 1834)            ', 'Lửng chó', 'SPA_04361', 'Lửng chó nặng 3 - 5kg, dài thân 540 - 610mm, đuôi 162 - 180mm, Đầu nhỏ, mõm ngắn và hơi nhọn. Chân ngắn. Bộ lông dài và thô, màu vàng hung, mút lông xám, Đầu, mỏm và bốn vó chân đen, Đuôi dài bằng một phần ba chiều dài thân. Lông đuôi rậm, màu xám Lửng chó sống trên các savan cây bụi, ven các nương rẫy, dọc theo khe suối. Sống đơn, kiếm ăn từ chập tối đến nửa đêm trên các nương bãi, ven khe suối, bờ ruộng nước. Sinh hoạt thầm lặng và tỏ ra thận trọng. Lửng chó ăn giun đất, cào cào, châu chấu, ốc hến, nhái ngoé và một số củ, quả, hạt cây lương thực trong khu vực sinh sống. Lửng chó sinh sản vào các tháng 4, 5, 6. Mang thai 60 ngày, mỗi lứa đẻ 3 - 4 con trong tổ tự làm ở các bụi cây rậm. Con non trưởng thành sinh dục sau 10 tháng.', NULL, 'Bắc Việt Nam Viễn Đông Liên Xô (cũ), Triều Tiên, Trung Quốc, .', NULL, NULL, 'Đây là loài thú thuộc họ chó Canidae có ích trong sản xuất nông lâm nghiệp. Có gia trị nghiên cứu khoa học và là thu nuôi làm cảnh trong các công viên, vườn thú.', NULL, NULL, NULL, 'VnCreature'),
(4326, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Felidae', 'Mèo', 'FAM_148', 'Catopuma', NULL, 'GEN_0333', 'catopumatemminckii', 'Catopuma temminckii', '(Vigors and Horsfield. 1827)          ', 'Báo lửa', 'SPA_04362', 'Đặc điểm nhận dạng:\n\nBộ lông báo lửa không có hoa văn hoặc đốm sọc; nếu có, có thể 2 sọc mờ dọc lưng. Lông đồng mầu hoặc đỏ da bò hoặc xám gio hay nâu hung. Mặt có 2 sọc trắng từ khoé mắt lên đỉnh đầu, 2 - 3 vạch trắng ở mép môi trên. Mầu lông lưng và bụng ít tách biệt. Đặc điểm quan trọng nhất là đuôi có 2 mầu rõ rệt: mặt trên cùng mầu thân, mặt dưới sáng.\n\nSinh học, sinh thái:\n\nThức ăn gồm thú rừng Hoẵng Muntiacus muntjak, Cheo Tragulus javanicus, Khỉ Macaca mulatta, Nai Cervus  unicolor, Lợn rừng non Sus scrofa, thỏ, chuột, chim, gà, v.v... Báo lửa sống và hoạt động ở rừng núi đất, núi đá với các kiểu sinh cảnh rừng khác nhau; hoạt động kiếm ăn ban đêm, săn mồi chủ yếu trên mặt đất. Chưa có tài liệu về sinh sản.', NULL, 'Trong nước: Nơi thu mẫu gồm Lai Châu, Tuyên Quang, Lạng Sơn, Bắc Cạn, Yên Bái, Hà Tây, Thanh Hoá, Quảng Trị, Thừa Thiên – Huế, Gia Lai, Kontum, Lâm Đồng. Báo lửa có phân bố rộng trong nước.\n\nThế giới: Nêpan, Ấn Độ, Nam Trung Quốc, Mianma, Thái Lan, Lào, Cambodia Malaisia, Indoesia.', NULL, NULL, 'Loài thú quí hiếm và có giá trị nghiên cứu khoa học. Góp phần điều hoà số lượng cá thể quần thể các loài động vật con mồi trong môi trường tự nhiên và cân bằng sinh thái.', 'EN', NULL, NULL, 'vncreatures'),
(4327, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Felidae', 'Mèo', 'FAM_148', 'Felis', NULL, 'GEN_0714', 'felisbengalensis', 'Felis bengalensis', 'Kerr, 1792', 'Mèo rừng', 'SPA_04363', 'Hình dạng giống mèo nhà, nặng 3 - 5 kg, dài thân 450 - 550mm, dài đuôi 250 - 290mm. Lông mềm màu vàng trắng điểm nhiều đốm đen không đều, quanh đốm đen viền vàng nâu. Bụng và chân màu xám trắng. Đầu có những sọc màu đen, trắng chạy dọc từ đỉnh đầu đến mũi. Mũi màu hồng nhạt, lông quanh miệng màu trắng. Mèo rừng sống ở rừng thứ sinh nghèo, trên các savan cây bụi, các bãi cây ven nương rẫy. Không có nơi ở cố định. Vận động nhanh nhẹn, leo trèo, bơi lội giỏi. Kiếm ăn đêm, ngày ngủ trong hốc cây, hang đá, trong bụi rậm hay trên chạc cây to kín. Thường ngồi rình mồi, đợi khi con mồi đi qua, nhảy ra vồ và ngoạm vào gáy. Mèo rừng ăn chuột, sóc, chim, lưỡng cư và các loại côn trùng (cào cào, châu chấu). Thức ăn ưa thích là chuột.', NULL, 'Mèo rừng gặp ở khắp các tỉnh trung du và miền núi và kể cả các khu rừng phục hồi núi đá ven biển miền Trung Việt Nam Viễn Đông Liên Xô (cũ), Triều Tiên, Trung Quốc, Ấn Độ, Nêpan, Mianma, Thái Lan, Campuchia, Lào, Malaixia, Indonesia, Philippines.', NULL, NULL, 'Mèo rừng ăn chuột nên rất có ích cho sản xuất nông lâm nghiệp. Đây là loài thú thuộc họ Mèo Felidae cho da lông đẹp, cho nguyên dược liệu và thương mại.', NULL, NULL, NULL, 'vncreatures.net'),
(4328, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Felidae', 'Mèo', 'FAM_148', 'Felis', NULL, 'GEN_0714', 'felischaus', 'Felis chaus', '(Guldenstaedt, 1776)', 'Mèo ri', 'SPA_04364', 'Mèo có Bộ lông màu xám tro đến vàng nâu, phần bụng lông sáng hơn và dài hơn. Đặc điểm nổi bật của mèo ri là Bộ lông đơn giản, gần như đồng mầu hoặc chỉ có đốm mờ ở thân và có lông đen dài ở đỉnh tai. Nhưng có một số vệt trắng ở mặt và 2 vệt ở mặt trong chân trước; nhiều vệt đốm mờ ở phía ngoài của 4 chân. Mèo non có thể có một số dải đen ở thân. Đuôi ngắn không quá nửa dài thân, thường xấp xỉ 1/ 3 ; có 4 - 5 vòng đen ở nửa cuối đuôi. Ở Việt Nam loài này chưa được nghiên cứu. Theo Kanchanasakha et al. (1998), Mèo ri sống ở các trảng cỏ, trảng cây bụi và các bờ lau lách dọc sông và đầm lầy. Mèo hoạt động cả ban ngày và đêm, thường là sáng sớm và chiều tối. Thức ăn bao gồm các loài thú gặm nhấm, chim, bò sát, ếch nhái, côn trùng và cá. Mỗi lứa đẻ thường 3 con, đôi khi tới 5 con. Mèo con mở mắt sau 11-15 ngày tuổi.', NULL, 'Nơi thu mẫu: Tây Ninh (1932) Vườn quốc gia Lò Gò - Sa Mác, Gia Lai (K’Bang); Chưa xác định được đầy đủ vùng phân bố. Ấn Độ, Pakixtan, Xri Lanka, Tây Nam Trung Quốc, Thái Lan.', NULL, NULL, 'Góp phần điều hoà số lượng các vật mồi, giúp cân bằng sinh thái. Có thể nuôi làm cảnh ở các vườn thú để nghiên cứu sinh thái học.', 'DD', NULL, NULL, 'vncreatures.net'),
(4329, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Felidae', 'Mèo', 'FAM_148', 'Felis', NULL, 'GEN_0714', 'felismarmorata', 'Felis marmorata', '(Martin, 1837)', 'Mèo gấm', 'SPA_04365', 'Loài thú nhỏ trong họ nhà Mèo Felidae. Bộ lông mịn xốp, thay đổi lớn về hoa văn. Nền lông mầu xám xanh hay nâu son; có nhiều vệt đen ở đầu, cổ và lưng; có hoa văn gần kiểu hoa văn của báo gấm nhưng nhỏ hơn, bị đứt quãng và mờ lẫn trong nền lông lưng. Có 2 dải lông đen chạy từ cổ đến gốc đuôi, tách biệt với các vân ở lưng; nhiều đốm nhỏ ở đùi. Đuôi dài xấp xỉ dài thân và nhiều vệt đen nhỏ không thành vòng đuôi rõ như báo gấm. Mèo gấm còn ít được nghiên cứu. Thức ăn gồm các loài chim, gậm nhấm nhỏ, rắn, bò sát, ếch nhái, côn trùng. Mèo sống và hoạt động ở vùng rừng núi cây gỗ lớn và rừng tái sinh và kể cả trên núi đất và núi đá, hoạt động về đêm.', NULL, 'Nơi thu mẫu: Lai Châu, Lào Cai, Sơn La, Bắc Kạn, Phú Thọ, Đắk Lak, Lâm Đồng. Mèo gấm phân bố rộng ở các vùng rừng núi trong toàn quốc. Nêpan, Ấn Độ, Mianma, Malaixia, Indonesia, Thái Lan.', NULL, NULL, 'Mèo gấm trước đây khá phổ biến trong các khu rừng thường xanh và bán thường xanh. Do bị săn bắt nhiều và sự thoái hoá rừng trữ lượng của mèo gấm bị giảm sút nghiêm trọng.', 'VU', NULL, NULL, 'vncreatures.net'),
(4330, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Felidae', 'Mèo', 'FAM_148', 'Felis', NULL, 'GEN_0714', 'felistemmincki', 'Felis temmincki', '(Vigors and Horsfield, 1827)', 'Beo lửa', 'SPA_04366', 'Bộ lông báo lửa không có hoa văn hoặc đốm sọc; nếu có, có thể 2 sọc mờ dọc lưng. Lông đồng mầu hoặc đỏ da bò hoặc xám gio hay nâu hung. Mặt có 2 sọc trắng từ khoé mắt lên đỉnh đầu, 2 - 3 vạch trắng ở mép môi trên. Mầu lông lưng và bụng ít tách biệt. Đặc điểm quan trọng nhất là đuôi có 2 mầu rõ rệt: mặt trên cùng mầu thân, mặt dưới sáng. Thức ăn gồm thú rừng Hoẵng Muntiacus muntjak, Cheo Tragulus javanicus, Khỉ Macaca mulatta, Nai Cervus  unicolor, Lợn rừng non Sus scrofa, thỏ, chuột, chim, gà, v.v... Báo lửa sống và hoạt động ở rừng núi đất, núi đá với các kiểu sinh cảnh rừng khác nhau; hoạt động kiếm ăn ban đêm, săn mồi chủ yếu trên mặt đất. Chưa có tài liệu về sinh sản.', NULL, 'Nơi thu mẫu gồm Lai Châu, Tuyên Quang, Lạng Sơn, Bắc Cạn, Yên Bái, Hà Tây, Thanh Hoá, Quảng Trị, Thừa Thiên – Huế, Gia Lai, Kontum, Lâm Đồng. Báo lửa có phân bố rộng trong nước. Nêpan, Ấn Độ, Nam Trung Quốc, Mianma, Thái Lan, Lào, Cămpuchia Malaixia, Inđônêxia.', NULL, NULL, 'Loài thú quí hiếm và có giá trị nghiên cứu khoa học. Góp phần điều hoà số lượng cá thể quần thể các loài động vật con mồi trong môi trường tự nhiên và cân bằng sinh thái.', 'EN', NULL, NULL, 'vncreatures.net'),
(4331, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Felidae', 'Mèo', 'FAM_148', 'Neofelis', NULL, 'GEN_1296', 'neofelisnebulosa', 'Neofelis nebulosa', '(Griffith, 1821)            ', 'Báo gấm', 'SPA_04367', 'Thú cỡ trung bình trong Họ Mèo Felidae, sau Hổ và Báo mai hoa. Bộ lông có hoa văn rất đẹp. Lông màu gio sáng hoặc vàng sáng, có nhiều hoa vân lớn ở 2 bên lưng, các hoa văn được viền vành đen khép kín và rất nét. Nhiều vệt đen chạy dài từ giữa thân theo sống lưng xuống hết đuôi; nhiều đốm đen nhỏ ở đầu, đùi. Dọc đuôi có nhiều vòng khoanh rõ nhưng bị đứt quãng hoặc mờ ở mặt dưới đuôi Thức ăn gồm các loài động vật rừng cỡ nhỡ như hoãng, cheo cheo, khỉ, voọc, sóc, tê tê, gà. Báo gấm sống và hoạt động chủ yếu ở rừng cây gỗ cao vùng rừng núi đất, hoặc các thung lũng núi đá. Báo sống độc thân, có lúc đi đôi, hoạt động ban đêm, leo trèo giỏi. Chưa có tư liệu về sinh sản của báo gấm ở Việt Nam. ở Thái Lan Báo gấm mang thai 90 - 95 ngày, đẻ 2 - 4 con mỗi lứa, con non nặng 150-180g (Kanchanasakha et al., 1998)', NULL, 'Lai Châu, Lào Cai, Bắc Kạn, Tuyên Quang, Hoà Bình, Hà Tĩnh, Nghệ An, Lâm Đồng. Báo gấm có phân bố rộng ở các vùng rừng núi trong cả nước, nhưng số lượng hiếm Nam Trung Quốc, Nêpan, Mianma, Malaixia, Indonesia, Thái Lan', NULL, NULL, 'Loài thú quí, hiếm, có giá trị nghiên cứu khoa học và góp phần điều hoà số lượng cá thể các quần thể con mồi, giúp cân bằng sinh thái tự nhiên', 'EN A1c,d C1+2a', 'VU A2cd + 4cd', NULL, 'VnCreature'),
(4332, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Felidae', 'Mèo', 'FAM_148', 'Panthera', NULL, 'GEN_1434', 'pantherapardus', 'Panthera pardus', '(Linnaeus, 1758)            ', 'Báo hoa mai', 'SPA_04368', 'Báo hoa mai thân dài, chân cao. Nền lông mầu vàng nhạt ở phần lưng, trắng bạc ở phần bụng. Trên toàn thân từ đầu, thân, đuôi kể cả dưới bụng có nhiều đốm đen. Những đốm ở lưng có hình hoa mai (giữa đốm mầu vàng chấm đen như nhuỵ hoa), đốm ở đầu nhỏ, phần nửa gốc đuôi đốm đen lớn. Ngoài dạng báo bình thường kể trên, còn có dạng báo đen toàn thân mầu đen đốm hoa mai lặn trong nền lông nên khó nhìn thấy. Đây là dạng biến dị cá thể cùng loài (P. paradus), rất hiếm gặp Thức ăn gồm thịt thú rừng: lợn, hươu, nai, trâu, bò non, khỉ, voọc, kể cả gia súc, và các loài gặm nhấm lớn. Vùng sống và hoạt động bao gồm nhiều dạng rừng núi, chủ yếu rừng già ít tác động. Thú kiếm ăn đêm và cả ban ngày ở nơi vắng người, thường nằm nghỉ trên các cành cây. Báo hoạt động đơn lẻ, chỉ sống đôi vào mùa sinh sản. Chưa có tư liệu về sinh sản của Báo hoa mai ở Việt Nam. Theo Kanchanasakha et al. (1998), Báo hoa mai mang thai 90 – 105 ngày, mỗi lứa đẻ thường 2 - 3 con. Sau khoảng 1 năm tuổi báo con tách khỏi bố mẹ để sống độc lập', NULL, 'Lai Châu, Bắc Kạn, Quảng Trị, Thừa Thiên - Huế, Lâm Đồng. Báo hoa mai có phân bố rộng ở các vùng rừng núi trong toàn quốc, nhưng số lượng rất ít Ấn Độ, Bănglađet, Nam Nêpan, Đông Nam Trung Quốc, Mianma, Thái Lan, Lào, Cămpuchia, Inđônêxia', NULL, NULL, 'Loài thú quí, hiếm, có giá trị nghiên cứu khoa học và góp phần điều hoà số lượng cá thể các quần thể con mồi, giúp cân bằng sinh thái tự nhiên', 'CR A1d C1+2a', 'VU A2cd', NULL, 'VnCreature'),
(4333, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Felidae', 'Mèo', 'FAM_148', 'Panthera', NULL, 'GEN_1434', 'pantheratigris', 'Panthera tigris', '(Linnaeus, 1758)            ', 'Hổ', 'SPA_04369', 'Cỡ lớn nhất trong Họ Mèo Felidae có thể nặng 200 - 250kg. Nền lông vàng hoặc vàng sáng, phần bụng trắng. Mặt và dọc thân có nhiều sọc đen. Hổ dễ phân biệt bằng các dải đen này Thức ăn gồm nhiều loài thú rừng và gia súc. Hổ sống và hoạt động ở vùng rừng núi với các kiểu rừng, kể cả vùng cây bụi lau lách, trảng cỏ tranh trong rừng. Hổ có vùng hoạt động rất lớn. Chúng không sống cố định, thường hoạt động di chuyển trong vùng rừng của 2 - 3 tỉnh kế cận, hoạt động ban đêm. Hổ có thể giao phối quanh năm nhưng tập trung vào một số tháng nhất định tuỳ từng vùng. Thời gian mang thai khoảng 100 ngày, mỗi lứa đẻ thường 2 - 3 con nhưng có thể hơn. Hổ con tách mẹ sống độc lập khi 18 – 28 tháng tuổi. Hổ cái bắt đầu sinh sản ở 3 – 4 năm tuổi, hổ đực trưởng thành muộn hơn 4 – 6 năm', NULL, 'Phân bố rộng  Bănglađét, Mianma, Inđônêxia, Malaixia, Thái Lan, Lào, Cămpuchia', NULL, NULL, 'Loài thú quí, hiếm có giá trị nghiên cứu khoa học, đồng thời góp phần điều hoà số lượng cá thể các quần thể con mồi', 'CR A1d C1+2a', 'EN', NULL, NULL),
(4334, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Felidae', 'Mèo', 'FAM_148', 'Pardofelis', NULL, 'GEN_1470', 'pardofelismarmorata', 'Pardofelis marmorata', '(Martin, 1837)', 'Mèo gấm', 'SPA_04370', 'Loài thú nhỏ trong họ nhà Mèo Felidae. Bộ lông mịn xốp, thay đổi lớn về hoa văn. Nền lông mầu xám xanh hay nâu son; có nhiều vệt đen ở đầu, cổ và lưng; có hoa văn gần kiểu hoa văn của báo gấm nhưng nhỏ hơn, bị đứt quãng và mờ lẫn trong nền lông lưng. Có 2 dải lông đen chạy từ cổ đến gốc đuôi, tách biệt với các vân ở lưng; nhiều đốm nhỏ ở đùi. Đuôi dài xấp xỉ dài thân và nhiều vệt đen nhỏ không thành vòng đuôi rõ như báo gấm. Mèo gấm còn ít được nghiên cứu. Thức ăn gồm các loài chim, gậm nhấm nhỏ, rắn, bò sát, ếch nhái, côn trùng. Mèo sống và hoạt động ở vùng rừng núi cây gỗ lớn và rừng tái sinh và kể cả trên núi đất và núi đá, hoạt động về đêm.', NULL, 'Trong nước: Nơi thu mẫu: Lai Châu, Lào Cai, Sơn La, Bắc Kạn, Phú Thọ, Đắk Lak, Lâm Đồng. Mèo gấm phân bố rộng ở các vùng rừng núi trong toàn quốc. Thế giới: Nêpan, Ấn Độ, Mianma, Malaixia, Indonesia, Thái Lan.', NULL, NULL, 'Thú quí, hiếm có giá trị nghiên cứu khoa học và góp phần điều hoà số lượng cá thể các quần thể con mồi.', 'VU', NULL, NULL, 'Vncreatures'),
(4335, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Felidae', 'Mèo', 'FAM_148', 'Pardofelis', NULL, 'GEN_1470', 'pardofelisnebulosa', 'Pardofelis nebulosa', '(Griffith, 1821)', 'Báo gấm', 'SPA_04371', 'Đặc điểm nhận dạng:\n\nThú cỡ trung bình trong Họ Mèo Felidae, sau Hổ và Báo mai hoa. Bộ lông có hoa văn rất đẹp. Lông màu gio sáng hoặc vàng sáng, có nhiều hoa vân lớn ở 2 bên lưng, các hoa văn được viền vành đen khép kín và rất nét. Nhiều vệt đen chạy dài từ giữa thân theo sống lưng xuống hết đuôi; nhiều đốm đen nhỏ ở đầu, đùi. Dọc đuôi có nhiều vòng khoanh rõ nhưng bị đứt quãng hoặc mờ ở mặt dưới đuôi.\n\nSinh học, sinh thái:\n\nThức ăn gồm các loài động vật rừng cỡ nhỡ như hoãng, cheo cheo, khỉ, voọc, sóc, tê tê, gà. Báo gấm sống và hoạt động chủ yếu ở rừng cây gỗ cao vùng rừng núi đất, hoặc các thung lũng núi đá. Báo sống độc thân, có lúc đi đôi, hoạt động ban đêm, leo trèo giỏi. Chưa có tư liệu về sinh sản của báo gấm ở Việt Nam. ở Thái Lan Báo gấm mang thai 90 - 95 ngày, đẻ 2 - 4 con mỗi lứa, con non nặng 150-180g (Kanchanasakha et al., 1998).', NULL, 'Trong nước: Nơi thu mẫu gồm Lai Châu, Lào Cai, Bắc Kạn, Tuyên Quang, Hoà Bình, Hà Tĩnh, Nghệ An, Lâm Đồng. Báo gấm có phân bố rộng ở các vùng rừng núi trong cả nước, nhưng số lượng hiếm.\n\nThế giới: Nam Trung Quốc, Nêpan, Mianma, Malaisia, Indonesia, Thái Lan', NULL, NULL, 'Loài thú quí, hiếm, có giá trị nghiên cứu khoa học và góp phần điều hoà số lượng cá thể các quần thể con mồi, giúp cân bằng sinh thái tự nhiên.', 'EN', NULL, NULL, 'vncreatures'),
(4336, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Felidae', 'Mèo', 'FAM_148', 'Prionailurus', NULL, 'GEN_1623', 'prionailurusbengalensis', 'Prionailurus bengalensis', 'Kerr, 1792.', 'Mèo rừng', 'SPA_04372', 'Đặc điểm nhận dạng:\n\nHình dạng giống mèo nhà, nặng 3 - 5 kg, dài thân 450 - 550mm, dài đuôi 250 - 290mm. Lông mềm màu vàng trắng điểm nhiều đốm đen không đều, quanh đốm đen viền vàng nâu. Bụng và chân màu xám trắng. Đầu có những sọc màu đen, trắng chạy dọc từ đỉnh đầu đến mũi. Mũi màu hồng nhạt, lông quanh miệng màu trắng.\n\nSinhhọc, sinh thái:\n\nMèo rừng sống ở rừng thứ sinh nghèo, trên các savan cây bụi, các bãi cây ven nương rẫy. Không có nơi ở cố định. Vận động nhanh nhẹn, leo trèo, bơi lội giỏi. Kiếm ăn đêm, ngày ngủ trong hốc cây, hang đá, trong bụi rậm hay trên chạc cây to kín. Thường ngồi rình mồi, đợi khi con mồi đi qua, nhảy ra vồ và ngoạm vào gáy. Mèo rừng ăn chuột, sóc, chim, lưỡng cư và các loại côn trùng (cào cào, châu chấu). Thức ăn ưa thích là chuột.', NULL, 'Việt Nam: Mèo rừng gặp ở khắp các tỉnh trung du và miền núi và kể cả các khu rừng phục hồi núi đá ven biển miền Trung Việt Nam\n\nThế giới: Viễn Đông Liên Xô (cũ), Triều Tiên, Trung Quốc, Ấn Độ, Nêpan, Mianma, Thái Lan, Campuchia, Lào, Malaixia, Indonesia, Philippines.', NULL, NULL, 'Mèo rừng ăn chuột nên rất có ích cho sản xuất nông lâm nghiệp. Đây là loài thú thuộc họ Mèo Felidae cho da lông đẹp, cho nguyên dược liệu và thương mại.', NULL, NULL, NULL, 'vncreatures'),
(4337, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Felidae', 'Mèo', 'FAM_148', 'Prionailurus', NULL, 'GEN_1623', 'prionailurusviverrinus', 'Prionailurus viverrinus', '(Bennett, 1833)            ', 'Mèo cá', 'SPA_04373', 'Về hình thể Mèo cá rất giống mèo rừng nhưng có kích thước lớn hơn. Những đặc điểm phân biệt giữa hai loài trước hết đặc điểm ở đuôi, đuôi mèo cá ngắn rõ rệt, chỉ xấp xỉ 1/3 dài thân (đuôi Mèo rừng xấp xỉ nửa dài thân); đuôi Mèo cá có đốm, vòng mờ lẫn trong nền xám (rất rõ ở đuôi Mèo rừng). Bộ lông Mèo cá màu xám gio và nhiều đốm mờ nhỏ lẫn trong nền xám. Đốm ở Méo cá nhỏ hơn ở mèo rừng. Thức ăn gồm cá, cua, ốc, chuột, chim… Mèo cá sống ở các sinh cảnh ven các thuỷ vực gần rừng như rừng thường xanh, rừng tràm, rừng ngập mặn ven biển và đồng bằng sông Cửu Long, các trảng cây bụi, trảng lau sậy dọc sông, suối. Mèo hoạt động chủ yếu trên mặt đất, bơi lội giỏi. Mèo làm tổ trong các hốc đất đá, bụi rậm, hốc cây,… Thời gian mang thai khoảng 63 ngày, mỗi lứa đẻ 1 - 4 con.', NULL, 'Trong nước: Chủ yếu ở vùng phía nam. Nơi thu mẫu: Cao Bằng, Khánh Hòa, Thành phố Hồ Chí Minh, Kiên Giang. Thế giới: Ấn Độ, Nêpan, Bănglađet, Mianma, Nam Trung Quốc, Pakixtan, Xri Lanka, Đài Loan, Thái Lan, Malaixia, Indonesia.', NULL, NULL, 'Góp phần điều hoà số lượng cá thể các loài động vật con mồi trong tự nhiên. Có giá trị nghiên cứu khoa học và nuôi cảnh trong các vườn thú.', 'EN', 'EN', NULL, 'VnCreature'),
(4338, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Herpestidae', 'Cầy Lỏn', 'FAM_180', 'Herpestes', NULL, 'GEN_0870', 'herpestesjavanicus', 'Herpestes javanicus', '(E Geoffroy Samt-Hilaire. 1818)          ', 'Lỏn tranh', 'SPA_04374', 'Chiều dài đầu - thân: 350 - 410 mm. Chiều dài đuôi: 250 - 290 mm. Lông trên đầu màu nâu đỏ đến nâu sẫm. Toàn bộ bộ lông màu nâu xen trắng. Chân có màu của thân hoặc sẫm hơn một chút. Đuôi dài khoảng 2/3 thân. Khi giật mình nó xù lông trông to hơn bình thường. Con cái có 3 cặp vú. Sống ở rừng suy thoái, đồng cỏ nhiều hơn trong rừng xanh. Sống và kiếm ăn đơn độc. Mùa động dục hoặc nuôi con sống ghép đôi hoặc nhóm nhỏ. Ẩn nấp trong hang hoặc hốc cây. Thức ăn gồm chuột, chim và côn trùng nhỏ, đôi khi bắt gà rừng. Kiếm ăn cả ngày lẫn đêm. Có thể giao chiến với rắn độc vì chúng rất nhanh nhẹn, bắt và cắn vào cổ rắn cho tới chết. Mùa giao phối không rõ ràng, thường giao phối trong hang dưới đất. Mỗi lần đẻ 2 - 4 con. Mang thai 6 tuần. Ở trại nuôi dưỡng có thể có tuổi thọ là 6 năm.', NULL, 'Ở Việt Nam loài này phân bố hầu khắp ở các khu rừng nguyên sinh, thứ sinh, trảng cỏ, cây bụi và gặp ở vùng dân cứ sống quanh khu vực có rừng từ Bắc đến Nam và tới độ cao 800m Loài này phân bố rộng khắp châu Á từ Iran, Pakistan, Ấn Độ, Mianma, Nêpan, vùng Sikkim, Bangladesh, Thái Lan, Lào, Campuchia, Việt Nam, Malaixia, đảo Java', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4339, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Herpestidae', 'Cầy Lỏn', 'FAM_180', 'Herpestes', NULL, 'GEN_0870', 'herpestesurva', 'Herpestes urva', '(Hogdson. 1836)            ', 'Cầy móc cua', 'SPA_04375', 'Loài thú ăn thịt nhỏ. Chiều dài đầu - thân: 440 - 480 mm. Chiều dài đuôi: 265 - 310 mm. Trọng lượng: 4 - 3 kg. Đặc điểm nổi bật là có một vệt trắng kéo dài từ góc mép qua cổ đến bả vai. Đuôi dài gần bằng 1/2 thân, lông đuôi xù. Bộ lông màu nâu xám, cổ đen, ngực nâu đỏ, bụng nâu nhạt, chân nâu sẫm hoặc đen. Sống và kiếm ăn đơn độc. Mùa động dục hoặc nuôi con sống với nhau thành đàn. Sống ở rừng dọc theo con suối, rừng khộp, rừng thường xanh cây gỗ lớn. Thức ăn là những con vật nhỏ như cua, côn trùng dưới nước, chim nước hoặc các loài bò sát. Kiếm ăn đêm, bơi và lặn dưới nước giỏi.', NULL, 'Ở Việt Nam loài này có khắp các khu rừng còn tốt và sống gần các khu vực thủy vực. Đã gặp loài này ở một vài khu vực rừng ven biển. Miền nam Trung Quốc, Nêpan, miền đông Mianma, Thái Lan, Lào, Campuchia, Malaixia, Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4340, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Mustelidae', 'Chồn', 'FAM_254', 'Aonyx', NULL, 'GEN_0124', 'aonyxcinerea', 'Aonyx cinera', '(Rafinesque, 1832)', 'Rái cá nhỏ', 'SPA_04376', 'Rái cá vuốt bé có thân hình ngắn, chắc hơn các loài rái cá khác. Màng bơi không phủ hết ngón chân và có phủ lông. Tai có nắp che lỗ tai. Bộ lông mầu nâu nhạt hoặc xám nâu, phần bụng mầu sáng hơn. Đặc điểm nổi bật là vuốt chân nhỏ, không thò ra khỏi ngón Thức ăn của Rái cá vuốt bé chủ yếu là các loài cua, ốc, côn trùng, sau mới đến ăn cá. Vùng sống và hoạt động gắn liền với các thuỷ vực, dọc bờ biển ở những nơi có rừng ngập mặn, ngập nước ngọt, nước lợ, dọc suối, hồ đầm. Rái cá vuốt bé hoạt động về đêm, đôi khi gặp cả ban ngày; sống theo đàn, mỗi đàn 3 - 8 con hoặc nhiều hơn. Mỗi năm đẻ 1 - 2 lứa, mỗi lứa 2 - 3 con. Cả bố và mẹ cùng chăm sóc con non.', NULL, 'Trong nước: Nơi thu mẫu và quan sát gồm Quảng Ninh (Vịnh Hạ Long), Quảng Trị, Bình Phước, Lâm Đồng, Kiên Giang, Cà Mau. Rái cá vuốt bé phân bố rộng trên toàn quốc. ', NULL, NULL, 'Góp phần điều hoà số lượng cá thể các quần thể động vật thuỷ sinh. Có thể nuôi làm cảnh ở công viên nước, vườn thú.', 'VU', 'VU', NULL, 'VnCreature'),
(4341, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Mustelidae', 'Chồn', 'FAM_254', 'Arctonyx', NULL, 'GEN_0149', 'arctonyxcollaris', 'Arctonyx collans', 'F G Cuvier. 1825', 'Lửng lợn', 'SPA_04377', 'Chiều dài đầu -  thân: 650 - 1040 mm. Chiều dài đuôi: 120 - 170 mm. Trọng lượng: 7 - 14 kg. Thú lớn, mập, bộ lông màu vàng, xám và đen, thay đổi theo mùa. Lông vùng cằm chân, đầu vai và lưng màu đen. Má và trán có đám lông màu trắng. Móng chân trước dài hơn móng chân sau. Mũi dài chài ra phía trước giống mũi lợn. Con chưa trưởng thành đầu trắng, chóp tai trắng, móng trân màu trắng hồng. Có khả năng đều thích nghi với nhiều môi trường khác nhau từ rừng sâu trũng đến rừng sâu có độ cao 3.500m so với mặt biển. Đôi khi kiếm ăn ở vùng đất cánh tác ven rừng. Thức ăn gồm nhiều loại măng, củ, giun, côn trùng, con vật kể cả cuốn chiếu. Dùng mũi đảy hoặc bới đất giống lợn rừng. Có thể dùng móng chân trước bới tìm côn trùng, củ. Kiếm ăn đêm, một mình. Ban ngày ngủ trong hang đất tự đào. Màu giao phối có thể ghép đôi. Thị giác không tốt, nhưng khứ giác rất tốt. Thân có mùa hôi rất nặng. Mỗi lần đẻ 2 - 3 con. ở trại nuôi dưỡng có thể sống đến 14 năm.', NULL, ' Việt Nam loài này phân bố ở Tây Nguyên (Đắc Nông, Đắc Lắc, Kontum),  Bình Phước (Vườn quốc gia Bù Gia Mập)', NULL, NULL, NULL, NULL, 'NT', NULL, 'VnCreature'),
(4343, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Mustelidae', 'Chồn', 'FAM_254', 'Lutra', NULL, 'GEN_1120', 'lutralutra', 'Lutra lutra', '(Linnaeus, 1758)', 'Rái cá thường', 'SPA_04379', 'Rái cá thường có thân hình dài, mềm dẻo. Mõm ngắn, đầu hơi dẹp bề ngang. Có màng bơi da trần phủ hết ngón. Vuốt ngòn chân dài thò ra khỏi ngón nhưng ngắn và tù. Tai nhỏ, vành tai tròn có nắp che lỗ tai. Bộ lông màu xám đến nâu hung đốm hoa râm, hơi thô; phần bụng màu xám tro, họng và má phớt trắng. Lông đệm dày không thấm nước. Dài đuôi xấp xỉ nửa dài thân, đuôi dài tròn đều nhỏ dần từ gốc đến mút đuôi. Da mũi trần có viền hình chiếc đe. Thức ăn chủ yếu gồm cá, sau đến cua, ốc và một số động vật thủy sinh khác. Vùng sống và hoạt động gắn liền với các thuỷ vực (bờ biển, sông ngòi, đầm hồ, khe suối, ao) chủ yếu ở các vùng rừng núi. Rái cá thường kiếm ăn ở các vực nước trong. Rái cá đào hang làm tổ ở bờ các thuỷ vực kể trên, trong các hốc đá, hố cây hoặc sử dụng các hang đá có sẵn. ở các vùng thuỷ triều chúng hoạt động theo con nước, lúc nước lên. Vì vậy, chúng có thể hoạt động cả ban ngày nếu không bị uy hiếp. Rái cá sống theo gia đình, mỗi đàn 3 - 5 con. Nhưng khi kiếm ăn chúng có thể tập trung thành đàn trên dưới 10 - 12 con. Rái cá thường đẻ tập trung vào các tháng 2 - 4 hàng năm, mang thai khoảng 61 ngày, đẻ con trong các hốc cây, hoặc hang đất, đá, mỗi lứa 2 - 4 con. Rái cá mẹ chăm sóc con khoảng 2-3 tháng, rái cá con sống với bố mẹ cho đến khi gần thành thục hoàn toàn.', NULL, 'Trong nước: Lai Châu, Lào Cai, Yên Bái, Bắc Kạn, Hoà Bình, Quảng Ninh, Hà Nội, Gia Lai, Lâm Đồng. Thế giới: Phân bố rộng ở châu Âu và châu Á.', NULL, NULL, 'Có giá trị nghiên cứu khoa học và góp phần điều hoà số lượng cá thể các quần thể động vật, thực vật thuỷ sinh.', 'VU', 'NT', NULL, 'VnCreature'),
(4344, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Mustelidae', 'Chồn', 'FAM_254', 'Lutra', NULL, 'GEN_1120', 'lutraperspicillata', 'Lutra perspicillata', '(I. Geoffroy, 1826)', 'Rái cá lông muợt', 'SPA_04380', 'Rái cá lông mượt có thân hình dài mềm dẻo. Mõm ngắn hơi dẹp bề ngang, đầu tương đối tròn. Màng bơi da trần phủ hết ngón. Vuốt dài, sắc. Tai lớn hơn tai rái cá thường, vành tai tròn, có nắp che lỗ tai. Bộ lông mầu xám đến nâu hung, gần giống rái cá thường nhưng lông dài và mịn mượt hơn. Môi trên, má, họng và cổ mầu trắng sữa; phần trắng này kéo đến ngực. Lông bụng mầu sáng hơn trên lưng. Đặc điểm nổi bật khác với các loài rái cá khác là đuôi dẹp ra hai bên dáng mái chèo. Thức ăn chủ yếu là cá, sau đến các loài khác như cua, ốc, ếch nhái, lưỡng cư… Vùng sống và hoạt động gắn liền với các thuỷ vực: bờ biển, sông ngòi, khe suối, có thể chỉ ở các vùng nước trong và chảy. Rái cá lông mượt đào hang làm tổ ở các hốc cây, hốc đá. Chúng hoạt động cả đêm và ngày, sống theo đàn, mỗi tổ 3- 5 con; lúc kiếm ăn có thể quy tụ thành đàn lớn 7 - 10 con. Khi bơi chân áp sát thân, dùng đuôi để bơi như mái chèo. Nghiên cứu về sinh sản còn ít, thời gian mang thai khoảng 63 ngày, mỗi lứa đẻ 2-3 con. Con sơ sinh yếu và chưa mở mắt.', NULL, 'Trong nước: Nơi thu mẫu hoặc đã quan sát thấy gồm Quảng Ninh (vịnh Hạ long), Đắk Lắk, Lâm Đồng. Rái cá lông mượt phân bố rộng trong cả nước. Thế giới: Apganixtan, Bănglađét, Irắc, Trung Quốc, Indonesia (Sumatra, Java, Borneo), Malaixia, Xingapo, Nêpan, Pakixtan, Thái Lan.', NULL, NULL, 'Có giá trị nghiên cứu khoa học và góp phần điều hoà số lượng cá thể các quần thể động vật thuỷ sinh.', 'EN', NULL, NULL, 'VnCreature'),
(4345, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Mustelidae', 'Chồn', 'FAM_254', 'Lutra', NULL, 'GEN_1120', 'lutrasp', 'Lutra sp.', NULL, 'Rái cá (rái cá móng)', 'SPA_04381', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4346, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Mustelidae', 'Chồn', 'FAM_254', 'Lutra', NULL, 'GEN_1120', 'lutrasumatrana', 'Lutra sumatrana', '(Gray, 1865)', 'Rái cá lông mũi ', 'SPA_04382', 'Đặc điểm nhận dạng:\nRái cá lông mũi có thân hình dài, mềm dẻo. Màng bơi da trần phủ hết ngón. Tai có nắp che lỗ tai. Bộ lông mầu nâu sẫm, sẫm đen; phần dưới thân, bên cổ và phần dưới Họ:ng mầu nâu ít khác biệt với mầu lưng. Môi dưới, cằm và trước họng mầu hơi trắng. Chóp đuôi thỉnh thoảng có đốm trắng. Đặc điểm nổi bật là da mũi có phủ lông. Vuốt thứ hai và thứ năm gần như bằng nhau về chiều dài; ngón thứ ba và thứ tư dài hơn ngón thứ hai và thứ năm. Vuốt rất phát triển (8 - 10 cm) nhọn, sắc.\nSinh học, sinh thái:\nThức ăn chủ yếu là cá, sau đến các loài khác như cua, ốc, thằn lằn, rắn, ếch nhái,... Các mẫu vật rái cá lông mũi được sưu tầm tại các tỉnh vùng đồng bằng sông Cửu long trên các sinh cảnh rừng ngập nước: rừng tràm, rừng đước, sú vẹt, rừng dừa nước dọc bờ biển, sông lớn hoặc kênh rạch. Rái cá lông mũi sống thành đàn 2 - 4 con; mùa nước cạn (tháng 12 - 3) chúng thường tụ tập đàn lớn hơn 7 - 10 con. Rái cá đào hang làm tổ trong các bờ đất, ụ đất cao, cửa hang thường thông ngầm dưới nước. Chúng hoạt động vào sáng sớm, chiều tối và ban đêm. Sinh sản chưa được nghiên cứu. Tuy nhiên, ở Vườn Quốc gia U Minh Thượng (Kiên Giang) đã gặp rái cá 1 - 2 tháng tuổi vào tháng 3/2000 (Nguyễn Xuân Đặng và cộng sự, 2000).', NULL, 'Trong nước: Đã thu được mẫu vật ở Thừa Thiên - Huế, An Giang (Long Xuyên), Kiên Giang (U Minh Thượng), Cần Thơ, Cà Mau (Ngọc Hiển, Trần Văn Thời, Thới Bình). Có thể hiện nay rái cá lông mũi chỉ phân bố ở các tỉnh thuộc đồng bằng sông Cửu Long.\nThế giới: Thái Lan, Inđônêxia (Sumatra, Borneo), Malaixia.', NULL, NULL, 'Góp phần điều hoà số lượng cá thể các quần thể động vật thuỷ sinh và có gí trị nghiên cứu khoa học, nuôi làm cảnh ở các công viên nước, vướn thú.', 'EN', NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=2&loai=1&ID=5535'),
(4347, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Mustelidae', 'Chồn', 'FAM_254', 'Lutrogale', NULL, 'GEN_1121', 'lutrogaleperspicillata', 'Lutrogale perspicillata', '(Geoffroy Saint-Hilaire, 1826)', 'Rái cá lông mượt', 'SPA_04383', 'Rái cá lông mượt có thân hình dài mềm dẻo. Mõm ngắn hơi dẹp bề ngang, đầu tương đối tròn. Màng bơi da trần phủ hết ngón. Vuốt dài, sắc. Tai lớn hơn tai rái cá thường, vành tai tròn, có nắp che lỗ tai. Bộ lông mầu xám đến nâu hung, gần giống rái cá thường nhưng lông dài và mịn mượt hơn. Môi trên, má, họng và cổ mầu trắng sữa; phần trắng này kéo đến ngực. Lông bụng mầu sáng hơn trên lưng. Đặc điểm nổi bật khác với các loài rái cá khác là đuôi dẹp ra hai bên dáng mái chèo. Thức ăn chủ yếu là cá, sau đến các loài khác như cua, ốc, ếch nhái, lưỡng cư… Vùng sống và hoạt động gắn liền với các thuỷ vực: bờ biển, sông ngòi, khe suối, có thể chỉ ở các vùng nước trong và chảy. Rái cá lông mượt đào hang làm tổ ở các hốc cây, hốc đá. Chúng hoạt động cả đêm và ngày, sống theo đàn, mỗi tổ 3- 5 con; lúc kiếm ăn có thể quy tụ thành đàn lớn 7 - 10 con. Khi bơi chân áp sát thân, dùng đuôi để bơi như mái chèo. Nghiên cứu về sinh sản còn ít, thời gian mang thai khoảng 63 ngày, mỗi lứa đẻ 2-3 con. Con sơ sinh yếu và chưa mở mắt.', NULL, 'Trong nước: Nơi thu mẫu hoặc đã quan sát thấy gồm Quảng Ninh (vịnh Hạ long), Đắk Lắk, Lâm Đồng. Rái cá lông mượt phân bố rộng trong cả nước. Thế giới: Apganixtan, Bănglađét, Irắc, Trung Quốc, Indonesia (Sumatra, Java, Borneo), Malaixia, Xingapo, Nêpan, Pakixtan, Thái Lan.', NULL, NULL, 'Có giá trị nghiên cứu khoa học và góp phần điều hoà số lượng cá thể các quần thể động vật thuỷ sinh.', 'EN', NULL, NULL, 'VnCreature'),
(4348, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Mustelidae', 'Chồn', 'FAM_254', 'Martes', NULL, 'GEN_1163', 'martesflavigula', 'Martes flavigula', '(Boddaert, 1785)            ', 'Chồn vàng', 'SPA_04384', 'Loài thú ăn thịt nhỏ có kích thước trung bình Dài thân 450 - 600mm, dài đuôi 380 - 450mm. Con trưởng thành có thể cân nặng từ 3 - 5kg. Lưng màu vàng đất, mông và chi phớt nâu xám, Đầu gáy bàn chân và đuôi nâu đen. Bụng vàng nhạt. Cằm và má trắng.Chân có gan bàn chân trần và các móng vuốt sắc Chồn vàng sống trong nhiều sinh cảnh khác nhau, kể cả trên các đồi cây bụi và rừng ngập mặn. Thích hợp là các rừng cây gỗ, trú thân trong các hốc cây, hốc đá, hang đất và cả trong bụi rậm. Sống đơn đôi khi theo nhóm nhỏ 3 - 4 con. Chồn vàng nổi tiếng là loài leo trèo giỏi và có tốc độ di chuyển rất nhanh. Bơi lội tốt, kiếm ăn ngày hoặc đêm (phụ thuộc vào khả năng và hoạt động của con mồi. Rất khôn khéo lúc hoạt động. Chồn vàng ăn các loại chim sóc, chuột, rắn và cả các loài thú có kích thước lớn hơn nó (khỉ, cheo cheo, và các loài cầy vòi ăn quả). sinh sản vào mùa hè, mang thai 220 - 290 ngày. Mỗi năm đẻ một lứa, mỗi lứa 1 - 3 con.', NULL, 'Chồn vàng có ở hầu khắp các tỉnh có rừng, kể cả rừng ngập mặn. Chồn vàng có thể gây những tác hại đáng kể đối với các loài động vật săn bắn và động vật nuôi. Vùng Đông Á, Siberia  đến các đảo thuộc Malaixia và Indonesia, phía tây đến Pakistan.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4349, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Mustelidae', 'Chồn', 'FAM_254', 'Melogale', NULL, 'GEN_1197', 'melogalecucphuongensis', 'Melogale cucphuongensis', 'Nadler et al., 2011', 'Chồn bạc má Cúc Phương', 'SPA_04385', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4350, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Mustelidae', 'Chồn', 'FAM_254', 'Melogale', NULL, 'GEN_1197', 'melogalemoschata', 'Melogale moschata', '(Gray, 1831)            ', 'Chồn bạc má', 'SPA_04386', 'Chiều dài đầu và thân: 330-450 mm. Chiều dài đuôi: 150-230 mm. Trọng lượng:  1-3 kg. Loài thú ăn thịt có kích thước nhỏ, ngoại hình tương tự trông giống chồn bạc má nam. Bộ lông màu nâu sẫm, lông ở lưng, đuôi nhạt hơn. Điểm nổi bật là có đường chỉ màu trắng chạy từ giữa đến đầu gáy, nhỏ hơn đường chỉ của chồn bặc má nam. Lông màu trắng lẫn vàng giữa trán và hai bên má. Miệng cằm, dưới cổ và mút đuôi màu trắng. Mặt trong của chân có màu trắng vàng. Sống ở bụi rậm trong rừng rậm. Thức ăn gồm chuột nhỏ và động vật không xương sống, nhưng loài chúng thường ăn nhất vẫn là giun đất. Ngủ trong hốc đất tự đào hoặc hốc cây.', NULL, 'miền Bắc Việt Nam Miền đông Ấn Độ nơi tiếp giáp Mianma, miền nam Trung Quốc nơi tiếp giáp Mianma, miền đông Trung Quốc', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4351, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Mustelidae', 'Chồn', 'FAM_254', 'Melogale', NULL, 'GEN_1197', 'melogalepersonata', 'Melogale personata', 'I. Geoffroy, 1831           ', 'Chồn bạc má nam', 'SPA_04387', 'Loài thú cỡ nhỏ. Dài thân 330 - 390mm, dài đuôi 145 - 210mm, dài bàn chân sau: 55 - 70mm, trọng lượng 1 - 3kg. Mặt có một số đốm trắng thay đổi, thường có vệt trắng ở đỉnh đầu kéo dài nhỏ gần đến lung. Cằm họng màu vàng nhạt. Bộ lông màu nâu đen. Phần lưng, sườn và chân nâu xám. Nệm chân có nhiều vạch ngang. Sống ở bìa rừng, trong các lùm cây quanh chùa miếu cũ, bản làng kể cả vùng đồng bằng đồi núi. Làm tổ và trú ẩn ở hang đất. Hoạt động kiếm ăn trên mặt đất. Thức ăn của chúng gồm: giun đất, dế, côn trùng, cua, ốc, nhái, rắn.', NULL, 'Việt Nam:Yên Bái (Lục Yên), Thừa Thiên - Huế, Quảng Nam - Đà Nẵng (Sơn Trà), Gia Lai, Kom Tum, Lâm Đồng (Di Linh), Đồng Nai (Biên Hòa), TP Hồ Chí Minh. Thế giới: Nêpan, Ấn Độ (Assam), Mianma, Thái Lan, Đông Dương', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4352, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Mustelidae', 'Chồn', 'FAM_254', 'Mustela', NULL, 'GEN_1264', 'mustelakathiah', 'Mustela kathiah', 'Hodgson, 1835', 'Triết bụng vàng', 'SPA_04388', 'Cỡ nhỏ trong họ chồn. Dài thân 190 - 262mm, dài đuôi 135 - 175mm, dài bàn chân sau: 33 - 48mm, trọng lượng 150 - 260g. Mõm nhọn vành tai nhỏ. Bộ lông có 2 màu rõ rệt. Lưng từ nâu nhạt đến nâu thẫm hoặc đỏ thẫm, bụng vàng nghệ ờ bên thân có một chỉ phân biệt màu lưng và màu bụng. Thức ăn của chúng chủ yếu là chuột, đôi khi ăn cả chim nhỏ, gà con. Sống ở ven rừng, ven cây bụi, dọc bờ suối, ao hồ, ven núi đá. Hang tổ ở gốc cây, hốc đá có nền đất cao ráo. Hang nhiều ngách và nhiều lối ra vào. Hoạt động tích cực vào sáng sớm và chiều tối.', NULL, 'Việt Nam: Tuyên Quang (Chiêm Hóa), Lào Cai (Tà Phình, Sapa), Lai châu (Mường Tè), Bắc Thái, Lạng Sơn, Sơn La (Quỳnh Nhai), Quảng Bình, Kontum (Sa Thầy). Thế giới: Hymalaya, Nêpan, bắc Ấn Độ (Assam), Pakitan, Mianma, nam Trung Quốc.', NULL, NULL, 'Tiêu diệt chuột, có thể thuần dưỡng nuôI để bắt chuột trong nhà. Là đối tượng nghiên cứu khoa học và thẩm mỹ', NULL, NULL, NULL, 'VnCreature'),
(4353, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Mustelidae', 'Chồn', 'FAM_254', 'Mustela', NULL, 'GEN_1264', 'mustelastrigidorsa', 'Mustela strigidorsa', 'Gray, 1853.', 'Triết chỉ lưng', 'SPA_04389', 'Cỡ nhỏ trong họ chồn. Dài thân 280mm, dài đuôi 150mm, dài bàn chân sau: 41mm, trọng lượng 306g. Cằm họng và ngực màu vàng nhạt. Bộ lông màu nâu thẫm hoặc hung nâu, có đường chỉ màu trắng hoặc vàng nhạt dọc sống lưng từ cổ đến gốc đuôi. Bụng có đường chỉ sáng từ ngực đến hậu môn. Chân và đuôi nâu thẫm Thức ăn của chúng gồm: gặm nhấm nhỏ, chim nhỏ, rắn, ếch nhái, thằn lằn.. Sống ở vùng cây bụi, bìa rừng, bờ sông, bờ hồ, ao. Làm tổ trong các gốc cây, khe đá giáp mặt đất. Hoạt động trên mặt đất nơi có nhiều cây đổ, cây bụi và khe đá.', NULL, 'Việt Nam: Yên Bái (Lục Yên), Bắc Thái. Có thể chỉ phân bố ở các tỉnh phía Bắc Thế giới: Nêpan, Ấn Độ (Assam, Sikkim), Mianma, Đông Dương.', NULL, NULL, 'Tiêu diệt chuột, có thể thuần dưỡng nuôI để bắt chuột trong nhà. Là đối tượng nghiên cứu khoa học và thẩm mỹ', NULL, NULL, NULL, 'VnCreature'),
(4354, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Ursidae', 'Gấu', 'FAM_389', 'Helarctos', NULL, 'GEN_0831', 'helarctosmalayanus', 'Helarctos malayanus', '(Raffles 1821)            ', 'Gấu chó', 'SPA_04390', 'Loài thú cỡ lớn, nặng 50 - 100kg. Gấu chó có thân hình béo tròn, trán rộng, tai tròn không vểnh cao như gấu ngựa. Chân trước và sau 5 ngón, vuốt nhọn cong khoẻ, chân trước đi vòng kiềng, đi bằng bàn. Dấu bàn chân sau có gót dài gần giống bàn chân trẻ em. Bộ lông mầu đen tuyền, ngắn và tương đối mịn đều, không thô như gấu ngựa; ở mõm sáng vàng. Lông cổ ngắn không tạo bờm, có xoáy ở bả vai. Lông trán và mặt sau vành tai mọc thành xoáy (khác với gấu ngựa).Yếm ngực hình chữ U mầu vàng nhạt, có trường hợp yếm ngực bị ngắt quãng, không thành chữ U rõ rệt. Đuôi rất ngắn, không nhô ra khỏi Bộ lông. Trong tự nhiên gấu chó chủ yếu ăn thực vật: các loại quả hạt như hạt dẻ, quả sung, vả, quả cọ, chuối, ngô, măng tre, nứa… Chúng cũng ăn cá, mật ong, trứng chim và thịt động vật khác nếu có điều kiện. Gấu chó ăn tạp. Trong nuôi nhốt Gấu chó có thể sử dụng nhiều loại thức ăn của người. Gấu chó sống ở rừng thường xanh, rừng đầu nguồn, rừng khộp, chủ yếu ở những khu rừng lớn, đặc biệt là rừng trên núi đá vôi. Tuy hình dáng nặng nề nhưng gấu chó rất lanh lợi. Gấu chó leo trèo và bơi lội giỏi, rất thích tắm nước. Chúng không có tổ cố định mà thường ngủ, nghỉ ngơi hoặc làm tổ ở hốc cây, hoặc trên cây. Gấu chó sống độc thân, chỉ ghép đôi trong mùa động dục hoặc nuôi con. Gấu mang thai khoảng trên 3 tháng, đẻ mỗi năm 1 lứa, 2 - 4 con non, thường 2 con. Gấu con sống với mẹ 1,5 - 2 năm. Tuổi tHọ: trong điều kiện nuôi tới 20 năm.', NULL, 'Lai Châu, Quảng Bình, Quảng Trị, Thừa Thiên - Huế, Đắk Lắk, Lâm Đồng, Tây Ninh. Gấu chó có phân bố dọc dãy Trường Sơn từ Lai Châu đến Tây Ninh. Ấn Độ, Nam Trung Quốc, Inđônêxia (Xumatra, Borneo), Thái Lan, Malaixia.', NULL, NULL, 'Có giá trị nghiên cứu khoa học nhằm tìm hiểu tập tính, sinh thái loài trong tự nhiên và giá trị làm cảnh khi nuôi ở công viên, sở thú.', 'EN', NULL, NULL, 'vncreatures.net'),
(4355, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Ursidae', 'Gấu', 'FAM_389', 'Ursus', NULL, 'GEN_2021', 'ursusmalayanus', 'Ursus malayanus', '(Raffles, 1821)            ', 'Gấu chó', 'SPA_04391', 'Loài thú cỡ lớn, nặng 50 - 100kg. Gấu chó có thân hình béo tròn, trán rộng, tai tròn không vểnh cao như gấu ngựa. Chân trước và sau 5 ngón, vuốt nhọn cong khoẻ, chân trước đi vòng kiềng, đi bằng bàn. Dấu bàn chân sau có gót dài gần giống bàn chân trẻ em. Bộ lông mầu đen tuyền, ngắn và tương đối mịn đều, không thô như gấu ngựa; ở mõm sáng vàng. Lông cổ ngắn không tạo bờm, có xoáy ở bả vai. Lông trán và mặt sau vành tai mọc thành xoáy (khác với gấu ngựa).Yếm ngực hình chữ U mầu vàng nhạt, có trường hợp yếm ngực bị ngắt quãng, không thành chữ U rõ rệt. Đuôi rất ngắn, không nhô ra khỏi Bộ lông.', NULL, 'Ba Vì', NULL, NULL, 'Có giá trị nghiên cứu khoa học nhằm tìm hiểu tập tính, sinh thái loài trong tự nhiên và giá trị làm cảnh khi nuôi ở công viên, sở thú.', 'EN', 'EN', NULL, 'vncreatures'),
(4356, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Ursidae', 'Gấu', 'FAM_389', 'Ursus', NULL, 'GEN_2021', 'ursusthibetanus', 'Ursus thibetanus', 'Cuvier, 1823            ', 'Gấu ngựa', 'SPA_04392', 'Thú cỡ lớn, nặng 80 -180kg (trong nuôi nhốt có thể 200kg). Gấu ngựa có dáng thân thô béo, trán rộng, tai tròn; chân trước và chân sau có 5 ngón; vuốt khoẻ nhọn và cong; đi bằng bàn; bàn chân sau dài có gót gần giống dấu bàn chân người. Bộ lông dài thô mầu đen tuyền, lông hai bên cổ dài tạo thành bờm. Ngực có yếm hình chữ V mầu vàng nhạt hoặc trắng bẩn. Đuôi rất ngắn, không thò ra khỏi bộ lông. Ngoài thiên nhiên gấu chủ yếu ăn thực vật: hạt dẻ, quả sung, vả, quả cọ, chuối, ngô, măng tre nứa,... Gấu cũng ăn động vật: cá, mật ong, trứng chim và thịt động vật khác nếu có điều kiện. Gấu ăn tạp, trong nuôi nhốt gấu ăn nhiều loại thức ăn của người. Gấu sống và hoạt động chủ yếu ở rừng già, rừng đầu nguồn, rừng hỗn giao, rừng khộp, rừng tre nứa; đôi khi đến kiếm ăn ở các nương rẫy cạnh rừng. Gấu không làm tổ cố định, thường làm tổ nghỉ ở hốc đá, hốc cây, có khi bẻ cành làm tổ nghỉ tạm trên cây lớn. Gấu sống độc thân, chỉ ghép đôi vào mùa động dục. Gấu mẹ nuôi con. Tuy hình dáng có vẻ nặng nề nhưng gấu rất lanh lợi, hiếu động, leo trèo, bơi lội giỏi. Gấu rất thích ăn mật ong và ong non, chúng thường leo các cây cao tìm phá tổ ong trong thân cây để ăn. ư liệu về sinh sản của gấu còn ít. Gấu đẻ hầu như quanh năm (Lê Hiều Hào, 1973), mỗi lứa 1 - 4 con, thường 2 con. Gấu con sống với mẹ 1,5 - 2 năm mới tách đàn. Thường gặp đàn gấu mẹ đi cùng con vào các tháng 9 - 11. Gấu thay lông vào tháng 2 - 3.', NULL, 'Trong nước: Lai Châu, Sơn La, Tuyên Quang, Nghệ An, Quảng Trị, Thừa Thiên - Huế, Quảng Nam, Bình Định, Gia Lai, Kontum, Đắk Lăk, Lâm Đồng Thế giới: Từ Apganixtan và đông Pakixtan Nhật Bản đến Hymalaya, Assam, Mianma, Bắc Thái Lan, Nam Trung Quốc, Lào, Cămpuchia.', NULL, NULL, 'Có giá trị nghiên cứu khoa học nhằm tìm hiểu tập tính, sinh thái loài trong tự nhiên và giá trị làm cảnh khi nuôi ở công viên, sở thú', 'EN', 'VU', NULL, 'VnCreature'),
(4357, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Viverridae', 'Cầy', 'FAM_394', 'Arctictis', NULL, 'GEN_0147', 'arctictisbinturong', 'Arctictis binturong', '(Raffles, 1821)            ', 'Cầy mực', 'SPA_04393', 'Bộ lông có mầu đen tuyền toàn thân, trừ phần mõm phớt trắng. Một số cá thể có mút lông màu trắng tạo nên Bộ lông màu hoa râm. Cầy mực sống ở các tỉnh phía Nam phần phớt trắng lan lên đến lưng. Lông dài thô và xù. Đuôi rất dài, gốc đuôi lớn, nhỏ dần về mút đuôi; mút đuôi có thể uốn cong cuộn vào thân cây lúc leo trèo. Tai có chòm lông dài, viền tai mầu trắng. Bàn chân rất khoẻ, vuốt dài nhọn và sắc. Thức ăn gồm nhiều loại quả cây và các động vật nhỏ sống trên cây như chim, chuột, côn trùng, rắn,…. Theo kết quả nghiên cứu về thức ăn của Cầy mực ở các cơ sở nuôi nhốt thì thức ăn của chúng hoàn toàn giống Cầy vòi mốc Paguma larvata, Cầy vòi đốm: ăn tạp gồm các loại quả chín, củ (khoai lang, khoai tây), thịt, cá, trứng, giun đất,…. Cầy mực sống và hoạt động ở rừng già, rừng tái sinh tốt cạnh rừng già. Chúng sống độc thân, hoạt động kiếm ăn ban đêm, sống thầm lặng, leo trèo giỏi, hoạt động chủ yếu trên cây. Khi leo trèo cầy dùng đuôi quấn vào cành cây để giữ thăng bằng. Cầy mực cũng xuống đất hoạt động, thích tắm nước và có thể bơi được. Cầy trưởng thành sinh dục 2 - 3 tuổi, thời gian chửa 92 - 94 ngày, đẻ 1 - 3 con, con sơ sinh nặng 400g.', NULL, 'Trong nước: Nơi thu mẫu gồm Lai Châu, Quảng Ninh, Ninh Bình, Thanh Hóa, Nghệ An, Quảng Bình, Quảng Trị, Thừa Thiên - Huế, Quảng Nam, Bình Định, Ninh Thuận, Gia Lai, Kontum, Đắk Lắk, Lâm Đồng. Có thể trước kia cầy mực phân bố rộng ở rừng trong toàn quốc. Nhưng hiện nay chúng chỉ có ở rừng Tây Nguyên và từ Lai Châu vào Bình Dương, Bình Phước, Đồng Nai, Tây Ninh. Thế giới: Nêpan, Ấn Độ, Mianma, Nam Trung Quốc, Thái lan, Lào, Campuchia.', NULL, NULL, 'Loài thú quí hiếm có giá trị nghiên cứu khoa học và giúp cân bằng hệ sinh thái tự nhiên. Xạ hương dùng làm chất định hương trong sản xuất mỹ phẩm.', 'EN', 'VU', NULL, 'VnCreature'),
(4358, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Viverridae', 'Cầy', 'FAM_394', 'Arctogalidia', NULL, 'GEN_0148', 'arctogalidiatrivirgata', 'Arctogalidia trivirgata', '(Gray, 1832)            ', 'Cầy tai trắng', 'SPA_04394', 'Bộ lông Cầy tai trắng có màu hung xám xỉn. Lưng có 3 hoặc 5 sọc nâu đen chạy dọc lưng từ bả vai đến mông. Sống mũi có thể có sọc nhỏ trắng mờ hoặc vàng nhạt. Mõm nhọn. Vành tai lớn mỏng và phủ lông trắng. Thân dài tròn. Đuôi luôn dài hơn thân, mầu nâu đen. Trong lượng  từ  2 - 4 kg, dài thân 540 - 630mm, dài đuôi 300 - 430mm. Thức ăn của Cầy tai trắng giống các loài Cầy vòi, gồm các loại quả chín như Nhội Bischofia trifoliata, Trâm Syzygium cumini, Nụ Garcinia tinctoria...) và một số động vật nhỏ như chim, chuột, côn trùng,… Về vùng sống và hoạt động thì những nơi thu mẫu như ở Tam Đảo, Hoà Bình, Gia Lai đều ở vùng núi cao trên 600m, vùng rừng cây gỗ lớn. ở rừng thưa chân núi thấp chưa gặp cầy tai trắng. Cầy hoạt động ban đêm, leo trèo cây giỏi, thường gặp chúng kiếm ăn nhiều con trên một cây, vì thế ở một số vùng gọi chúng là “ Cầy vòi đàn”. Theo Lekagul et al. (1977) Cầy tai trắng có thể sinh sản quanh năm, mỗi lứa đẻ 2 - 3 con. Cầy con thôi bú sau 2 tháng tuổi.', NULL, 'Trong nước: đả phát hiên và thu mẫu ở Vĩnh Phúc (Tam Đảo), Hoà Bình (Mai Châu, Tu Lý), Gia Lai (Kon Hà Nừng), Lâm Đồng. Ninh Thuận, Bình Thuận. Cầy tai trắng có phân bố rộng ở các vùng rừng núi cao trong toàn quốc. Thế giới: Ấn Độ, Nam Trung Quốc, Mianma, Thái Lan, Lào, Cămpuchia, Inđônêxia, Malaixia.', NULL, NULL, 'Loài thú qui, hiếm có giá trị nghiên cứu khoa học và góp phần cân bằng sinh thái tự nhiên.', 'LR', NULL, NULL, 'VnCreature'),
(4359, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Viverridae', 'Cầy', 'FAM_394', 'Artitis', NULL, 'GEN_0166', 'artitisbinturong', 'Artitis binturong', '(Raffles, 1822)', 'Cầy mực', 'SPA_04395', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4360, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Viverridae', 'Cầy', 'FAM_394', 'Chrotogale', NULL, 'GEN_0396', 'chrotogaleowstoni', 'Chrotogale owstoni', 'Thomas, 1921            ', 'Cầy vằn bắc', 'SPA_04396', 'Bộ lông Cầy vằn bắc mầu vàng nhạt hoặc xám bạc. Có 4 - 5 sọc đen lớn vắt ngang lưng xuống 2 bên sườn; 2 sọc đen chạy song song từ đỉnh đầu qua cổ và mở rộng xuống bả vai, đến đùi chân trước; tiếp nối 2 vạch tách biệt xuống đến đùi theo 2 sọc trên. Mặt có 3 sọc đen nhỏ kẹp giữa 2 sọc trắng chạy từ mũi đến đầu. Gốc đuôi có 2 vòng đen trắng, phần còn lại của đuôi (3/4) đồng mầu nâu đen. Đặc điểm nổi bật của Cầy vằn bắc khác với Cầy vằn nam là có nhiều đốm đen ở sườn và đùi (cầy vằn nam không có đốm) Thức ăn gồm giun đất, côn trùng, quả cây, chuột, ếch, nhái, chim, trứng chim. Cầy vằn đặc biệt thích ăn giun đất. Trong nuôi nhốt Cầy vằn ăn thịt, giun đất và nhiều loại trái cây. Vùng sống và hoạt động bao gồm nhiều kiểu rừng khác nhau, chủ yếu rừng núi đất, trong các thung lũng có độ ẩm. Cầy chủ yếu hoạt động ở mặt đất, chỉ vài trường hợp gặp Cầy trên cây cao 2m, nhưng leo trèo giỏi. Cầy sống độc thân, hoạt động ban đêm, kiếm ăn ban đêm. Chưa có tài liệu về sinh sản của cầy vằn trong thiên nhiên; trong nuôi nhốt Cầy vằn trưởng thành sinh dục vào 1,5 - 2 năm tuổi; động dục vào tháng 1- 2 ; đẻ con tháng 2 - 4; mỗi lứa 2 - 3 con; thời gian chửa 60- 68 ngày; con sơ sinh trên dưới 400g', NULL, 'Lào Cai, Yên Bái, Tuyên Quang, Lạng Sơn, Phú THọ:, Hoà Bình, Gia Lai, Lâm Đồng. Cầy vằn có phân bố rộng các tỉnh miền núi trong nước Tây Nam Trung Quốc, Lào', NULL, NULL, 'Loài thú quí, hiếm, có giá trị nghiên cứu khoa học và giúp cân bằng sinh thái tự nhiên. Tuyến xạ có thể sử dụng làm dược liệu hoặc trong công nghệ sản xuất mỹ phẩm', 'VU A1c,d C1', 'EN', NULL, 'VnCreature'),
(4361, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Viverridae', 'Cầy', 'FAM_394', 'Hemigalus', NULL, 'GEN_0851', 'hemigalusowstoni', 'Hemigalus owstoni', '(Thomas, 1912).', 'Cầy vằn bắc', 'SPA_04397', 'Bộ lông Cầy vằn bắc mầu vàng nhạt hoặc xám bạc. Có 4 - 5 sọc đen lớn vắt ngang lưng xuống 2 bên sườn; 2 sọc đen chạy song song từ đỉnh đầu qua cổ và mở rộng xuống bả vai, đến đùi chân trước; tiếp nối 2 vạch tách biệt xuống đến đùi theo 2 sọc trên. Mặt có 3 sọc đen nhỏ kẹp giữa 2 sọc trắng chạy từ mũi đến đầu. Gốc đuôi có 2 vòng đen trắng, phần còn lại của đuôi (3/4) đồng mầu nâu đen. Đặc điểm nổi bật của Cầy vằn bắc khác với Cầy vằn nam là có nhiều đốm đen ở sườn và đùi (cầy vằn nam không có đốm). Thức ăn gồm giun đất, côn trùng, quả cây, chuột, ếch, nhái, chim, trứng chim. Cầy vằn đặc biệt thích ăn giun đất. Trong nuôi nhốt Cầy vằn ăn thịt, giun đất và nhiều loại trái cây. Vùng sống và hoạt động bao gồm nhiều kiểu rừng khác nhau, chủ yếu rừng núi đất, trong các thung lũng có độ ẩm. Cầy chủ yếu hoạt động ở mặt đất, chỉ vài trường hợp gặp Cầy trên cây cao 2m, nhưng leo trèo giỏi. Cầy sống độc thân, hoạt động ban đêm, kiếm ăn ban đêm. Chưa có tài liệu về sinh sản của cầy vằn trong thiên nhiên; trong nuôi nhốt Cầy vằn trưởng thành sinh dục vào 1,5 - 2 năm tuổi; động dục vào tháng 1- 2 ; đẻ con tháng 2 - 4; mỗi lứa 2 - 3 con; thời gian chửa 60- 68 ngày; con sơ sinh trên dưới 400g.', NULL, 'Lào Cai, Yên Bái, Tuyên Quang, Lạng Sơn, Phú THọ:, Hoà Bình, Gia Lai, Lâm Đồng. Cầy vằn có phân bố rộng các tỉnh miền núi trong nước. Tây Nam Trung Quốc, Lào.', NULL, NULL, 'Loài thú quí, hiếm, có giá trị nghiên cứu khoa học và giúp cân bằng sinh thái tự nhiên. Tuyến xạ có thể sử dụng làm dược liệu hoặc trong công nghệ sản xuất mỹ phẩm.', 'VU', NULL, NULL, 'vncreatures.net'),
(4362, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Viverridae', 'Cầy', 'FAM_394', 'Paguma', NULL, 'GEN_1424', 'pagumalarvata', 'Paguma larvata', '(C E H Smith. 1827)         ', 'Cầy vòi mốc', 'SPA_04398', 'Cầy vòi mốc có kích thước lớn, trọng lượng 6 - 9 kg, dài thân 650 - 75mm, dài đuôi 535 - 660mm. Lông trên thân. Nửa đùi trên, nửa đuôi trong màu vàng xám. Bụng vàng xám. Nửa đùi dưới phần đuôi ngoài đen. Có một sọc trắng bắt đầu từ mũi đi qua giữa đầu và đến gáy, má màu trắng nhạt. Có đốm trắng ở góc tai và dưới mi mắt. Con đực có tuyến xạ giữa hậu môn và bộ phận sinh dục ngoài. Đây là loài sống chủ yếu ở rừng, đặc biệt là rừng gỗ có nhiều cây và dây leo có nhiều quả ăn được. Làm tổ trong gốc cây. Sống đơn, hoạt động kiếm ăn đêm (từ chập tối đến nửa đêm). Leo trèo giỏi, có thể nhảy từ cành này sang cành khác ở cự ly 2m hoặc nhảy từ trên cao 6 - 7m xuống đất chính xác. Tính bạo dạn, ít phát ra tiếng động khi kiếm ăn. Cầy vòi mốc ăn chủ yếu là quả cây rừng trong họ Dâu tằm Moraceae, Bồ hòn Sapindaceae, Trám Burceraceae, Thầu dầu Euphorbiaceae, Sến Sapotaceae. Vào các tháng hiếm quả cây rừng, Vòi mốc còn ăn cả côn trùng, cánh cứng, nhái, chuột (Phạm Nhật, 1982). Cầy vòi mốc động dục vào tháng 3 đến tháng 4, mang thai 1,5  đến 2 tháng, đẻ vào tháng 5 - 6. Mỗi năm đẻ một lứa, mỗi lứa đẻ 2 - 4 con. Cầy mẹ làm tổ đẻ cẩn thận trong các hốc cây. Con đẻ ra yếu, chưa mở mắt.', NULL, 'Ở nước ta cầy vòi mốc phấn bố khắp các tỉnh có rừng. Trung Quốc, Đài Loan, Việt Nam, Lào, Thái Lan, Mianma, Assam, Nêpan, Malaixia, Sumatra, Boneo', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4363, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Viverridae', 'Cầy', 'FAM_394', 'Paradoxurus', NULL, 'GEN_1447', 'paradoxurushermaphroditus', 'Paradoxurus hermaphrodis', '(Pallas, 1777)', 'Cầy vòi đốm', 'SPA_04399', 'Cầy vòi hương nặng 3 - 5 kg, dài thân 480 - 700mm, dài đuôi 400 - 660mm. Bộ lông nền màu xám. Có sọc đen chạy từ đầu dọc theo lưng đến gốc đuôi. Vai và hông mốc xám bẩn. Mặt xám đen có các đốm trắng bên má và bên mắt. Bốn vó chân đen, bụng xám, Đuôi dài, phần mặt trên gốc đuôi đen điểm vàng nhạt, mặt dưới vàng đất. Phần ngoài đuôi đen Cơ bản gần giống Cầy vòi mốc. Chủ yếu sống ở rừng thường xanh và nhiều kiểu rừng tàn phá còn sót lại hoặc những khu vực đất trồng cây ăn trái. Sinh hoạt kiếm ăn đêm, ngày ngủ. Thường đi đơn. Thức ăn chủ yếu là các loài quả cây rừng, thỉnh thoảng thấy chúng ăn côn trùng, trứng chim. Vòi hương sinh sản quanh năm nhưng tập trung vào các tháng 10, 11, 12.  Mỗi lứa đẻ 2 - 4 con trong hốc đá hay bọng cây lớn. Cầy con sinh trưởng khá nhanh.', NULL, 'Việt Nam loài này phân bố khá nhiều ở các tỉnh phía Nam từ Phan Rang trở vào đến Kiên Giang. Nam Trung Quốc, Nêpan, miền Đông Mianma, Thái Lan, Lào, Campuchia, Malaixia', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4364, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Viverridae', 'Cầy', 'FAM_394', 'Prionodon', NULL, 'GEN_1625', 'prionodonpardicolor', 'Prionodon pardicolor', 'Hodgson, 1841            ', 'Cầy gấm', 'SPA_04400', 'Cầy cỡ nhỏ, thân dài, đuôi dài. Bộ lông mầu vàng trắng, có nhiều đốm nâu đen từ cổ đến gốc đuôi và đùi; bốn sọc dọc từ cổ đến bả vai. Đuôi có 8 - 9 vòng đen, trắng khác với Cầy linsang chỉ 7 vòng. Phần bụng và Họng sáng trắng hơn phần lưng. Cả đực và cái đều có tuyến xạ. Thức ăn gồm chuột, rắn, ếch nhái, chim nhỏ, côn trùng. Nơi sống và hoạt động: ở rừng, chủ yếu rừng thứ sinh có nhiều dây leo cây bụi. Chưa gặp cầy ở bìa rừng. Hoạt động chủ yếu trên các cây thấp cách mặt đất 1 - 1,5m, đôi khi cũng xuống mặt đất. Cầy gấm sống độc thân, thầm lặng, hoạt động ban đêm. Đẻ con trong các hốc cây, mỗi lứa 2 con ', NULL, 'Trong nước: Nơi thu mẫu: Lào Cai, Bắc Kạn, Tuyên Quang, Thanh Hoá, Lạng Sơn, Bắc Giang, Quảng Ninh, Hoà Bình, Hà Tĩnh, Gia Lai, Lâm Đồng. Cầy gấm phân bố rộng ở Việt Nam. Thế giới: Ấn Độ, Nêpan, Mianma, Trung Quốc, Thái Lan, Inđônêxia, Lào.', NULL, NULL, 'Loài thú quí hiếm và có giá trị nghiên cứu khoa học. Góp phần điều hoà số lượng cá thể quần thể các loài động vật con mồi trong môi trường tự nhiên và góp phần cân bằng sinh thái.', 'VU', NULL, NULL, 'VnCreature'),
(4365, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Viverridae', 'Cầy', 'FAM_394', 'Viverra', NULL, 'GEN_2040', 'viverramegaspila', 'Viverra megaspila', '(Blyth, 1862)', 'Cầy giông sọc', 'SPA_04401', 'Kích thước và hình dáng gần giống với Cầy giông thường, trừ các đặc điểm phân biệt sau: ở phần lưng từ ngực đến gốc đuôi và đùi sau có nhiều đốm đen lớn rõ rệt trên nền sáng, đốm đen có thể tách rời hoặc tạo thành dải. Bờm lông đen dài chạy từ cổ dọc sống lưng đến mút đuôi. Vòng đuôi bị cắt bởi bờm lông màu đen ở mặt trên thành hình bán nguyệt, rõ nhất ở vòng mầu trắng. Đuôi có 4 vòng đen, trắng ở nửa phần gốc đuôi; nửa phần mút đuôi mầu đen (không có vòng). Có tuyến xạ cạnh hậu môn. Thức ăn của cầy giông sọc tương tự Cầy giông thường gồm chuột, ếch nhái, chim nhỏ, cua, cá, côn trùng, một số quả cây, có thể cả gia cầm, gia súc nhỏ. Vùng sống và hoạt động của Cầy giông sọc tương tự Cầy giông thường: vùng rừng, bìa rừng, cây bụi, nương rẫy; kể cả rừng tràm đước đồng bằng Nam Bộ:. Chúng làm tổ ở hốc cây, bụi rậm; hoạt động kiếm ăn ban đêm. Chưa có tư liệu về sinh sản.', NULL, 'Đắk Lắk, Lâm Đồng, Tây Ninh, Thành phố Hồ Chí Minh, Kiên Giang. Cầy giông sọc phân bố ở các tỉnh phía Nam. Mianma, Malaixia, Thái Lan.', NULL, NULL, 'Có giá trị nghiên cứu khoa học và góp phần cân bằng sinh thái.', 'VU', NULL, NULL, 'vncreatures.net'),
(4366, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Viverridae', 'Cầy', 'FAM_394', 'Viverra', NULL, 'GEN_2040', 'viverratainguensis', 'Viverra tainguensis', 'Sokolov. V. E, Rozhnov V., Pham T.A, 1997', 'Cầy giông tây nguyên', 'SPA_04402', 'Loài thú ăn thịt có kích thước trung bình, về hình thái, Cầy giông tây nguyên rất giống Cầy giông thường (Viverra zibetha). Những đặc điểm khác biệt là Bộ lông có mầu hung sáng ở phần lưng và vùng vai. Trên lưng có nhiều đốm xám đen hình bán nguyệt, lõm về phía sau nổi rõ trên nền lông. Phía sau bả vai kể từ sườn có dải mầu nâu sáng đi ngược lên phía lưng, sau đó đột ngột quay về phía sau chạy song song với bờm sống lưng và kết thúc ở gốc đuôi; thấp hơn còn có một dải tương tự nhưng ít nổi rõ. Ngực và bụng màu sáng. Các chân mầu xám nâu. Dài đuôi quá nửa dài thân. Đuôi có 6 hoặc 7 vòng đen, trắng. Chân trước có nếp da phủ lên ngón thứ 3 và thứ 4. Thức ăn gồm chuột, sóc, chim nhỏ, ếch nhái, lưỡng cư. Chưa nhiều tư liệu về vùng sống và hoạt động. Những mẫu vật thu được đều ở vùng bìa rừng và trong rừng. Chưa có tư liệu về sinh sản.', NULL, 'Lạng Sơn, Bắc Giang, Nghệ An, Gia Lai, Đắk Lắk. Có thể phân bố rộng ở Việt Nam. Loài mới công bố ở Việt Nam năm 1997.', NULL, NULL, 'Loài thú quí, hiếm ở Việt Nam, là chuỗi mắt xích sinh học quan trọng trong hệ sinh thái tự nhiên. Có giá trị nghiên cứu khoa học, làm thú nuôi trong công viên, sở thú …', 'VU', NULL, NULL, 'vncreatures.net'),
(4367, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Viverridae', 'Cầy', 'FAM_394', 'Viverra', NULL, 'GEN_2040', 'viverrazibetha', 'Viverra zibetha', 'Linnaeus. 1758            ', 'Cầy giông', 'SPA_04403', 'Chiều dài đầu thân: Con đực 790mm, con cái 770mm. Chiều dài đuôi: con đực 460, con cái 440mm. Trọng lượng: Từ 8 - 9 kg. Loài thú cỡ lớn trong họ nhà Cầy Viverridae.Bộ lông màu xám đen có 4 - 5 vạch đen bên mình, bên cổ có 3 đường chỉ đen nằm ngang, đuôi có 6 - 7 ngấn màu trắng xen đen. Miệng màu trắng. Phía sau tai có vệt màu trắng kéo xuống đến cổ. Từ sau gáy kéo xuống gốc đuôi có dải lông đen. Con đực to hơn con cái chút ít. Có khả năng thích nghi với nhiều môi trường khác nhau. Thức ăn gồm cá, trứng chim, bò sát, rắn cóc, sâu bọ, chuột, hoa quả, củ. Cầy giông có vai trò quan trọng trong hệ sinh thái, vì nó ăn cả động vật và thực vật nên nó là loài hạn chế các con vật nhỏ có vai trò phân tán thảo mộc. Kiếm ăn đêm và kiếm ăn ở trên cây nhiều hơn kiếm ăn ở dưới đất.', NULL, 'Việt Nam loài này phân bố ở các khu rừng còn tốt từ Bắc đến Nam. Từ miền Nam Trung Quốc đến miền Đông Ấn Độ, Thái Lan, Lào, Campuchia, Malaixia', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4368, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CARNIVORA', 'ĂN THỊT', 'ORD_013', 'Viverridae', 'Cầy', 'FAM_394', 'Viverricula', NULL, 'GEN_2041', 'viverriculaindica', 'Viverricula indica', '(Desmarest, 1804)            ', 'Cầy hương', 'SPA_04404', 'Cầy hương có kích thước nhỏ hơn cầy giông, cân nặng 2 - 4 kg, dài thân 540 - 630mm, dài đuôi 300 - 430mm. Lông màu xám bẩn. Dọc sống lưng có các vệt xám đen, hông có nhiều vệt đen mờ xếp thành hàng chạy từ vai đến mông, Đuôi dài, có 7 vòng trắng xen lẫn với 7 vòng đen. Con đực có tuyến xạ nằm giữa kẽ hai tinh hoàn. Cầy hương không sống trong rừng thường xanh. Sinh cảnh thích hợp là trên nương rẫy, ven khe suối, trên các savan đồi cây bụi. Sống đơn độc, kiếm ăn đêm (thường từ chập tối đến nửa đêm). Thức ăn ưa thích của cầy hương là côn trùng và chuột. Ngoài ra chúng còn ăn chim và một số loài bò sát (rắn, nhông) một số loại quả và rễ cây. Cầy hương sinh sản tập trung vào tháng 4,5,6. Mỗi lứa 2 - 3 con. Tuổi thọ khoảng 8 - 9 năm.', NULL, ' Trên toàn vùng Nam châu Á. Ở nước ta, cầy hương phân bố khắp các tỉnh miền núi và trung du.', NULL, NULL, 'Cầy hương cho xạ hương là một loại dược liệu quí. Có giá trị nghiên cứu khoa học và giúp cân bằng sinh thái tự nhiên.', NULL, NULL, NULL, 'VnCreature'),
(4369, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CETACEA', 'CÁ VOI', 'ORD_015', 'Delphinidae', 'Cá Heo', 'FAM_119', 'Sausa', NULL, 'GEN_1781', 'sausachinensis', 'Sausa chinensis', '(Osbeck,1765).', 'Cá heo trắng', 'SPA_04406', 'Có hình dạng và màu sắc thay đổi rất nhiều tùy theo vùng phân bố và theo tuổi. Nhìn chung, cơ thể có dạng hình con suốt, ở giữa thân mập to và thon nhỏ dần về phía hai đầu. Mõm dài và giới hạn rõ với đầu. Vây lưng nằm ở giữa lưng ngay phần gù cao của lưng (nên còn có tên là Cá heo lưng gù); vây đuôi hơi lõm và có khía ở giữa, gốc vây đuôi bị ép lại về phía hai bên nhưng phình ra về phía lưng-bụng; gốc vây bơi hơi rộng.\n\nMàu sắc: về phía bụng có màu sáng hơn, màu đậm ở hai bên thân và mặt lưng, có thể màu trắng ngà, màu xám nâu, xám nhạt hoặc trắng hơi tím; thường con non màu xám đen và khi trưởng thành có màu tím hồng (như ở vùng Quảng Ninh - Hải Phòng). Con trưởng thành có chiều dài từ 2 - 3m, con mới sinh dài khoảng 1m. Mỗi hàm có từ 29 - 38 đôi răng.\n\nSinh học, sinh thái:\n\nSinh sản quanh năm ở phía nam châu Phi, nhưng cao điểm là vào mùa hè. Thức ăn chính là các loại cá sống ven bờ và vùng cửa sông nơi chúng đang sống. Loài này thường sống từng nhóm nhỏ ít hơn 10 con, nhưng đôi khi lên đến 30 con. Chúng có tổ chức xã hội, di chuyển chậm chạp, thường nhảy lên nhưng không lộn cầu vồng.', NULL, 'Trong nước: ven bờ Quảng Ninh - Hải Phòng và Khánh Hoà (vịnh Bình Cang)\n\nThế giới: Loài sống ven bờ từ đông nam Trung Quốc qua Inđônêxia, Philippin, Ấn Độ, Đông nam châu Phi và bắc Ôxtrâylia.', NULL, NULL, 'Loài thú biển quí hiếm và có giá trị nghiên cứu khoa học, giúp cân bằng sinh thái tự nhiên.', 'EN A1c C2a.', NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=6119'),
(4370, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Emballonuridae', 'Dơi Bao', 'FAM_132', 'Taphozous', NULL, 'GEN_1912', 'taphozousmelanopogon', 'Taphozous melanopogon', '(Temminck, 1841)', 'Dơi bao đuôi  nâu đen', 'SPA_04407', 'Đầu — thân 67 — 86 mm, tai 21 — 23 mm, chân sau 13 — 15 mm, đuôi 11 — 9 — 26 mm, cẳng tay 60 — 68 mm; trọng lượng 21 - 26 g. Phần lưng của Dơi mộ râu đen có màu từ màu nâu sẫm ở những cá thể còn trẻ đến màu xám quế nhạt hơn ở những con đực trưởng thành. Phần cơ bản của lông có màu hơi hồng nhạt ở con đực trưởng thành và màu trắng ở con non và con trưởng thành. Phần bụng nhạt màu hơn phần lưng. Con cái ở Ấn Độ thường có màu hơi đỏ hơn và lông của cá thể trẻ có màu nâu, còn cá thể trưởng thành có màu ô liu hung. Râu họng của con đực trưởng thành là những đám lông đen dày đặc dài tới 25 mm trên toàn bộ chiều rộng của cổ họng. Một phần ba gần của cẳng tay có lông dọc theo mặt trong của mặt lưng và có cùng màu với mặt lưng. Tai có lông nhẹ dọc theo mép ngoài. Màng cánh chủ yếu có màu nâu đỏ. Đuôi dày ở chóp. Chân và bàn chân có lông. Có các túi xương bàn tay vô tuyến phát triển tốt ở cánh. Màng cánh gắn phía trên mắt cá chân với xương chày Môi trường sống. Nhiều sinh cảnh rừng và đô thị từ mực nước biển đến vùng đồi núi > 800 m. Dơi mộ râu đen ăn côn trùng trên không', NULL, '  Sri Lanka và Ấn Độ qua Nam Trung Quốc và Đông Nam Á vào các đảo của Indonesia bao gồm Borneo, Sumatra, Java, Lesser Sunda Is, Sulawesi và nhiều đảo nhỏ hơn, cũng ở Philippines', NULL, NULL, NULL, NULL, NULL, NULL, 'Gbif.org'),
(4371, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Emballonuridae', 'Dơi Bao', 'FAM_132', 'Taphozous', NULL, 'GEN_1912', 'taphozoustheobadi', 'Taphozous theobadi', '(Dobson, 1872)', 'Dơi bao đuôi đen', 'SPA_04408', 'Kích thước vừa, dài thân 88 - 95mm, đuôi dài 25 - 30mm, bình thường con đực có bao phát triển, dài cánh tay 70 - 75mm, dài đuôi 22 - 28mm, chân bàn dài 15 - 18mm, dài sọ 23, 5 - 24mm, nền sọ không thu hẹp, lồi, phía trước có viền góc. Không, trảy trước mắt phía dưới phát triển tốt. Cung gò má rộng 14 - 15mm, bờ phía trên phía trước của gò má dẹt, ổ mắt sau cung má không mỏng mỏng, ổ má sau eo thiếu ra, dài hàm 10 - 10,5mm. loài này thường đậu hay ngủ trong hang và kiếm ăn ở ven rừng, sống nhóm đàn, đôi khi có đàn lên đến hàng xương cá thể, loài sói ở Việt Nam', NULL, 'Việt Nam: loài này phân bố ở Hòa Bình (Chợ Bờ), Quảng Nam - Đà Nẵng. Thế giới: Mianma, Malaysia, Đông Dương, Indonesia (Java).', NULL, NULL, ' có giá trị nghiên cứu khoa học và tiêu diệt các loại côn trùng gây hại trong thiên nhiên.', NULL, NULL, NULL, 'VnCreature'),
(4372, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Aselliscus', NULL, 'GEN_0170', 'aselliscusstoliczkanus', 'Aselliscus stoliczkanus', '(Dobson, 1871)            ', 'Dơi nếp mũi ba lá', 'SPA_04409', 'Dơi có kích thước nhỏ. Thân dài 4 - 5mm, đuôi dài khoảng 3 - 4mm, dài cẳng tay 39 - 44mm, tai dài 1 - 14mm, bàn chân dài 9 - 9,5mm, sọ dài 26 - 26,5mm, hàm dài 1 - 1,4mm, cung gò má rộng khoảng 7,3 - 7,7mm. Răng trước hàm phía trước thấp bằng 1/2 của răng trước hàm phía sau. Hàm các răng hàm gặp nhau ở phía trước. Lá mũi sau với ba thuỳ riêng biệt, rãnh sâu ở giữa hai bên bờ của lá trung tâm ngăn cách nó với các lá ngoại vi. Các thuỳ ở bờ trên của lá mũi sau rộng, gần như tiếp xúc với nhau. Phần mũi trước ngang bằng phần ổ mắt. ', NULL, 'Các loài này được tìm thấy trong tất cả các nơi của vùng Đông Nam châu Á từ Thái Lan, Lào, Việt Nam đến Malaysia, Philippin, Borneo. Ở Việt Nam loài này tìm thấy ở Lai Châu (Mường Muôn), Lao Cai (Sapa), Ninh Bình (Cúc Phương), Hoà Bình (Chi Nê), Quảng Bình.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=25&loai=&ID=6032'),
(4373, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Coelops', NULL, 'GEN_0446', 'coelopsfrithii', 'Coelops frithii', 'Blyth, 1848', 'Dơi thuỳ không đuôi', 'SPA_04410', 'Loại mũi nhọn lớn, ống tay 43 - 47mm. Không có dấu vết. Lá mũi có vạt dài, thu gọn nổi lên trên lá bên sung sung. Bộ lông dài, mềm. Gắn kết dùi phát triển tuy không đuôi. Tai ngắn, tròn, bề mặt có lông. T. 75mm. OT. 43 - 47mm. Bắt đầu ở đó các dòng sen và hang đá. Chưa có bao nhiêu tài liệu nghiên cứu về nghiên cứu này. Thức ăn của chúng là loài côn trùng sống trong khu vực phân bố.', NULL, 'Việt Nam : Lào Cai, Thanh Hoá (Hồi Xuân). Thế giới: Vịnh Bengan, Thái Lan, Đông Dương, Đài Loan, Malaixia, Giava.', NULL, NULL, 'Có ý nghĩa khoa học lớn. Đông Dương có thể coi như cái nôi phát triển, phát sinh loại này, từ đó phát huy theo hướng Tây Bắc và Đông Nam. Có giá trị nghiên cứu khoa học, thẩm mỹ và tiêu diệt các loài côn trùng gây hại trong thiên nhiên', NULL, NULL, NULL, 'VnCreature'),
(4374, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Hipposideros', NULL, 'GEN_0886', 'hipposiderosarmiger', 'Hipposideros armiger', '(Hodgson. 1835)            ', 'Dơi mũi quạ', 'SPA_04411', 'Dơi cỡ lớn, dài thân 80 - 100mm, dài đuôi 48 - 70mm, dài cánh tay 89 - 100mm, dài tai 70 - 75mm, dài bàn chân 17 - 21mm, dài sọ 26,4 - 29,8mm, cung gò má rộng 16 - 18,9mm, dài hàm 11,5 - 12.8mm, răng nanh và răng răng hàm thứ 2 đều dài 11,1 - 12,9mm. Phía sau lá mũi sau có 4 lá phụ bên. Lá mũi sau không dài như lá mũi trước. Lông có màu vàng nâu ở mặt lưng và nhạt hơn ở mặt bụng. Loài này thường đậu trong các hang động và đường hầm, thức ăn của loài này là Muỗi và Côn trùng, sống thành đàn trong hang động núi đá.', NULL, 'Ở Việt Nam: loài này phân bố ở Hà Giang (Quảng Bạ), Lào Cai (Mường Muôn, Ngaitio), Bắc Thái (Chợ Đồn), Hoà Bình (Chi Nê), Quảng Ninh (vịnh Hạ Long), Ninh Bình (Cúc Phương), Thanh Hoà (Lang Chánh), Quảng Nam - Đà Nẵng, Lâm Đồng (Di Linh) Thế giới: Nêpan, Ấn Độ, Mianma, Đông nam Trung Quốc, Malaysia.', NULL, NULL, 'Loài hiếm gặp, có giá trị nghiên cứu khoa học, thẩm mỹ và tiêu diệt các loài côn trùng gây hại trong thiên nhiên.', NULL, NULL, NULL, 'VnCreature'),
(4375, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Hipposideros', NULL, 'GEN_0886', 'hipposiderosater', 'Hipposideros ater', 'Templeton, 1848            ', 'Dơi nếp mũi tro', 'SPA_04412', 'Chiều dài đầu và thân là 6-7cm. Cẳng tay 4cm. Sải cánh 23-25cm. Con cái lớn hơn con đực một chút. Màu nâu đỏ ở trên và màu nâu nhạt đến nâu vàng ở dưới. Hai phần ba mỗi sợi tóc có màu trắng, chỉ có phần ngọn có màu, thường có hai màu. Màng cánh trong mờ và màu nâu. Đôi tai lớn màu nâu xám và có gờ, bàn chân và ngón cái có màu thịt. Con non có màu nâu sẫm. Có ba vạt lá mũi nhỏ. Túi trước phía sau lá sau nổi bật ở con đực. Đuôi dài được bao bọc bởi một lớp màng, chỉ có phần chóp nhô ra.', NULL, 'Hipposideros ater là một loài dơi thuộc họ Hipposideridae. Nó được tìm thấy ở Úc, Ấn Độ, Indonesia, Malaysia, Myanma, Papua New Guinea, Philippines, Sri Lanka và Thái Lan.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.thainationalparks.com/species/dusky-leaf-nosed-bat'),
(4376, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Hipposideros', NULL, 'GEN_0886', 'hipposiderosbicolor', 'Hipposideros bicolor', '(Temminck, 1834)', 'Dơi mũi xinh', 'SPA_04413', 'Dơi lá tròn hai màu là một loài Dơi tương đối nhỏ. Chiều dài cẳng tay : lên tới 4,8 cm. Trọng lượng : lên tới 10 gram. Các sợi lông riêng lẻ của loài này có màu nhạt hoặc hơi trắng ở gốc và sẫm màu ở phần ngọn. Những sợi lông ở lưng có phần đuôi màu nâu sẫm và những sợi ở bụng có phần đầu màu trắng (tuy nhiên, một số mẫu vật có thể có màu cam sáng). Đôi tai to và tròn. Loài này thường đậu trong các hang động, đường hầm và kẽ đá. ', NULL, '  Thái Lan, Bán đảo Malaysia, Singapore, Sumatra, Java, Borneo, Sulawesi và Philippines.', NULL, NULL, NULL, NULL, NULL, NULL, 'Ecologyasia'),
(4377, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Hipposideros', NULL, 'GEN_0886', 'hipposideroscineraceus', 'Hipposideros cineraceus', '(Blyth, 1853)', 'Dơi mũi bé', 'SPA_04414', 'Dơi có kích thước nhỏ, dài cẳng tay 36 - 40,5mm, dài đuôi 24 - 30mm, dài tai 18,5 - 21mm, trọng lượng 4 - 5,5mm, hộp sọ: dài 13,2 - 13,9mm. Phần thân trên màu nâu vàng sang nâu xám nhạt; phần thân dưới màu trắng vàng sang nâu nhạt, lỗ tai to và tròn. Lá mũi đơn giản, không có các cánh bên; vách ngăn trong mũi phình ra ở đoạn giữa. Sống trong các hang động thành từng đàn số lượng lên tới hàng trăm con, đôi khi sống chung với loài dơi mũi xinh.', NULL, ' Pakistan, phía Bắc Ấn Độ, Mianma, Thái Lan, Việt Nam, bán đảo Mã Lai và ở Borneo loài này chỉ được ghi nhận từ Sabah trong các hang động ở vịnh Marudu, Madai, Baturong, Segarong và phía trên sông Kuamut,', NULL, NULL, 'Loài hiếm gặp, có giá trị nghiên cứu khoa học, thẩm mỹ và tiêu diệt các loài côn trùng gây hại trong thiên nhiên.', NULL, NULL, NULL, 'vncreatures.net'),
(4378, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Hipposideros', NULL, 'GEN_0886', 'hipposiderosdiadema', 'Hipposideros diadema', '(É. Geoffroy, 1813)', 'Dơi nếp mũi vương miện', 'SPA_04415', 'Hipposideros diadema được đặt tên theo lá mũi trước phức tạp, có hình móng ngựa và nằm trên vùng mũi hơi phồng lên. Hình dạng mũi này đã phát triển để hỗ trợ định vị bằng tiếng vang, bổ sung thêm lá mũi và các cơ phức tạp liên quan để giúp mũi cộng hưởng hiệu quả hơn. Lá ngang mọc thẳng và không có hình chiếu ở giữa. Chúng có đôi tai to chủ yếu là do cơ vành tai phát triển tốt, trong khi không có vành tai nào. Con đực có một túi nằm ở phía sau mũi, có thể tiết ra chất sáp, được cho là dùng để thu hút bạn tình và xác định địa vị. Chiều dài cơ thể dao động từ 6 đến 1 cm khi trưởng thành, với bộ lông màu nâu bao phủ tất cả trừ các chi. Phần bụng có màu nhạt hơn và có thể tìm thấy các đốm trắng ở vùng vai. Con trưởng thành nặng từ 34 đến 5 gram và sải cánh dài khoảng 15 đến 22 cm. Những móng vuốt khổng lồ được tìm thấy ở các chi sau và một móng vuốt duy nhất ở mỗi chi trước. Mỗi ngón chân của bàn chân có hai đốt ngón tay và đuôi ngắn thường được bao bọc trong uropatagium nhỏ. Công thức nha khoa là 1/2 1/1 2/2 3/3, răng hàm là dilambdodont, và các ống men khổng lồ hiện diện ở điểm nối ngà-men. Vùng miệng của hộp sọ có các nhánh vòm miệng tiền hàm được hợp nhất về phía trong và tách biệt rộng rãi với hàm trên về phía bên. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Diadem_leaf-nosed_bat'),
(4379, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Hipposideros', NULL, 'GEN_0886', 'hipposiderosgaleritus', 'Hipposideros galeritus', 'Canter, 1846            ', 'Dơi mũi Galê', 'SPA_04416', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4380, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Hipposideros', NULL, 'GEN_0886', 'hipposiderosgrandis', 'Hipposideros grandis', 'Allen 1936            ', 'Dơi nếp mũi lớn', 'SPA_04417', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4381, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Hipposideros', NULL, 'GEN_0886', 'hipposideroslarvatus', 'Hipposideros larvatus', '(Horsfield, 1823)            ', 'Dơi mũi xám', 'SPA_04418', 'Dơi cỡ trung bình, dài thân 60 - 80mm, dài đuôi 35 - 45mm, dài cánh tay 53 - 67mm, dài tai 20 - 23mm, dài bàn chân 10 - 15mm, dài sọ 18,5 - 12,5mm, cung gò má rộng 11,5 - 12,9mm, dài hàm 8 - 9mm, răng nanh trước - trong hàm trên không có rãnh với mũi nhọn nhỏ ở phía sau. Lá mũi trước với 3 lá phụ bên có hình chữ V ở giữa có vùng bờ giữa ở lá mũi trước. Phần mũi không dẹt. Bờ trên ổ mắt không lồi lên. Tiểu thiệt không lồi ra quá phía sau vòm miệng. Mặt lưng có màu xám nâu đến màu đỏ nâu. Mặt bụng nhạt hơn. Con đực có màu xám nâu, con cái có màu gỉ sắt. Loài này sống thành tập đoàn trong hang động đến hàng ngàn cá thể. Treo mình trên trần hang và thải phân xuống thành từng lớp dày. Thường đậu trong các hang động và đường hầm, thức ăn của loài này là Muỗi và Côn trùng.', NULL, 'Ở Việt Nam: loài này phân bố ở Lai Châu (Mường Muôn), Cao Bằng (Trùng Khánh), Hoà Bình (Chi Nê, Ngọc Tân), Quảng Ninh (vịnh Hạ Long), Quảng Nam - Đà Nẵng (Sơn Trà), Khánh Hoà (Nha Trang), Vũng Tàu - Côn Đảo (Côn Sơn), Kiên Giang (Phú Quốc). Thế giới: Ấn Độ, Mianma, trung Quốc (Hải Nam), Đông Dương, Indonesia .', NULL, NULL, 'Loài hiếm gặp, có giá trị nghiên cứu khoa học, thẩm mỹ và tiêu diệt các loài côn trùng gây hại trong thiên nhiên.', NULL, NULL, NULL, 'VnCreature'),
(4382, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Hipposideros', NULL, 'GEN_0886', 'hipposideroslylei', 'Hipposideros lylei', 'Thomas, 1913.', 'Dơi mũi Ly lây', 'SPA_04419', 'Tên bản địa: Dơi lá tròn mặt khiên. Đầu thân 72 - 95 mm, đuôi 48 - 55 mm, tai 30 mm, chân sau 16 - 21 mm, cẳng tay 73 - 84 mm. Khối lượng cơ thể trong khoảng 30,5 – 41,5 g. Dơi mũi lá mặt khiên có thùy thịt to ra phía sau lá mũi sau. Đầu nhọn được kết thúc thành hai hình chiếu xung quanh trán. Lá mũi rất lớn ở con đực trưởng thành nhưng nhỏ hơn nhiều ở con cái và con non. Có hai tờ rơi bên trên mỗi má. Tai lớn với chóp hình tam giác và không có vành tai. Bộ xương có màu xám nhạt đồng nhất đến màu nâu, hoặc đôi khi nhạt hơn ở mặt bụng. Ở hộp sọ, mào dọc và xương gò má phát triển vừa phải Môi trường sống. Rừng nguyên sinh cũng như một số rừng nhiệt đới bị xáo trộn, chia cắt ở vùng núi đá vôi. Dơi mũi lá khiên trú ngụ trong các hang động đá vôi', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Gbif.org'),
(4383, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Hipposideros', NULL, 'GEN_0886', 'hipposiderospomona', 'Hipposideros pomona', 'K. Andersen, 1918           ', 'Dơi mũi Pô ma', 'SPA_04420', 'Dơi cỡ nhỏ, dài thân 40,5mm, dài đuôi 30,6mm, dài cánh tay 41mm, tai dài 19,5 - 23,6mm, khoảng cách ốc tai giữa 1,14 - 1,5mm, bàn chân dài 7mm, sọ dài 15,6mm, cung gò mà rộng 8,6mm, khoẻ với phần trên nhỏ nhô ra thành khối u hình cầu lõm xuống được xác định, hàm dài 10,8mm. Phần mũi không dẹt. Bờ trên ổ mắt không lồi lên. Tiểu thiệt không lồi ra quá phía sau vòm miệng. Mặt lưng có màu nâu đến màu đỏ nâu. Mặt bụng nhạt hơn. Con đực có màu xám nâu, con cái có màu nâu sắt. Loài này sống thành tập đoàn trong hang động hay đường hầm, ống cống. Treo mình trên trần hang và thải phân xuống thành từng lớp dày. Thức ăn của loài này là Muỗi và Côn trùng.', NULL, 'Ở Việt Nam: loài này phân bố ở Hoà Bình (Chi Nê), Hà Nội, Quảng Nam - Đà Nẵng (Sơn Trà), Lâm Đồng (Đà Lạt), Bà Rịa - Vũng tàu (Côn Đả), Kiên Giang (Phú Quốc) ... Thế giới: Mianma, Đông Dương, Indonesia, Malaysia và một số đảo nhỏ lân cận', NULL, NULL, 'Loài hiếm gặp, có giá trị nghiên cứu khoa học, thẩm mỹ và tiêu diệt các loài côn trùng gây hại trong thiên nhiên.', NULL, NULL, NULL, 'VnCreature'),
(4384, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Hipposideros', NULL, 'GEN_0886', 'hipposiderospratti', 'Hipposideros pratti', '(Thomas, 1891)', 'Dơi nếp mũi Pratti', 'SPA_04421', 'Lông lưng màu nâu đỏ. Lông bụng nhẹ hơn. Con non nhẹ hơn con trưởng thành. Chiều dài cẳng tay 83,4-90,8 mm. Khối lượng cơ thể 53 - 68,9 g. Tất cả các loài dơi đều có tấm chắn hai thùy ngang phía sau lá mũi sau. Ở con đực và con cái non tấm khiên có thể nhỏ (phía dưới bên trái), nhưng ở con đực trưởng thành nó trở thành một cấu trúc thịt phức tạp (phía dưới bên phải). ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'University of Bristol'),
(4385, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Hipposideros', NULL, 'GEN_0886', 'hipposiderossp1', 'Hipposideros sp1', NULL, 'Dơi mũi', 'SPA_04422', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4386, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Hipposideros', NULL, 'GEN_0886', 'hipposiderossp2', 'Hipposideros sp2.', NULL, 'Dơi mũi', 'SPA_04423', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4387, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Hipposideros', NULL, 'GEN_0886', 'hipposiderossp3', 'Hipposideros sp3.', NULL, 'Dơi mũi', 'SPA_04424', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4388, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Hipposideros', NULL, 'GEN_0886', 'hipposiderossp4', 'Hipposideros sp4', NULL, 'Dơi mũi', 'SPA_04425', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4389, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Hipposideridae', 'Dơi Nếp Mũi', 'FAM_185', 'Hipposideros', NULL, 'GEN_0886', 'hipposiderosturpis', 'Hipposideros turpis', 'Bangs, 1901', 'Dơi mũi nhỏ', 'SPA_04426', 'Kích thước trung gian giữa loai Dơi nếp mũi quạ Hipposideros armiger và Dơi nếp mũi xám Hipposideros larvatus, chiều dài cẳng tay trung bình là 76,4mm. Hình dáng bên ngoài trông mảnh mai và xương xẩu hơn loài Dơi nếp mũi quạ Hipposideros armiger nhưng lớn hơn Dơi nếp mũi xám Hipposideros larvatus. Lá mũi bên gồm 3 lá phụ. Màu sắc bộ lông thường thay đổi từ màu vàng nhạt (vàng sáng) đến vàng đậm hay nâu đỏ sẫm. Dười 2 tai và phần cổ có màu vàng nghệ. Bụng màu nâu ánh vàng, gốc lông cũng có ánh vàng. Lưng màu đen sẫm, gốc lông màu trắng. Kích thước: HB (chiều dài thân đầu): 76,8 - 86,9mm; T (chiều dài đuôi): 38,2 - 60,2mm; E (chiều dài tai): 26 - 29,6mm; HF (chiều dài bàn chân sau, cả móng): 12,4 -18,3mm; FA (chiều dài cẳng tay):72,5 - 81,5mm; Wt (trọng lượng): 37,3gr. Loài này sống trong các hang động ở các sinh cảnh rừng nguyên sinh hay  các khu rừng trên núi đá vôi. Thức ăn là các loài muỗi và côn trùng nhỏ. Các dữ liệu về sinh sản chưa được cập nhật.', NULL, 'Nà Hàng (Tuyên Quang), Cát Bà (Hải Phòng), Vịnh Hạ Long (Quảng Ninh), Cúc Phương (Ninh Bình), Yên Bái, Pù Luông (Thanh Hóa) ', NULL, NULL, NULL, NULL, 'EN', NULL, 'VnCreature'),
(4390, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Megadermatidae', 'Dơi Ma', 'FAM_233', 'Megaderma', NULL, 'GEN_1175', 'megadermalyra', 'Megaderma lyra', 'E. Geoffroy, 1810           ', 'Dơi ma bắc', 'SPA_04427', 'Giống như loài Megaderma spama loài dơi ma bắc thuộc họ Dơi ma Megadermatidae được phân biệt bởi lỗ tai lớn nối với nhau ngang trán, màng nhĩ thon dài chia ra thành hai thùy không bằng nhau, một lá mũi nhô ra, và một màng giữa đùi không có xương nối với cẳng chân. (Dài cẳng tay 67 - 70mm, trọng lượng 40 - 50g), có một lá mũi trung gian nhỏ, một lá mũi phía sau có cạnh song song, cao và cằm nhọn hơn. Mặc dù có tên gọi là dơi ma, loài dơi này không hút máu, không giống các loài dơi ma nam thực sự được tìm thấy ở châu Mỹ. Thức ăn chủ yếu là các động vật chân đốt, nhưng cũng được ghi nhận là ăn các con dơi nhỏ bị mắc bẫy và các loài động vật có xương sống khác nhau kể cả chuột, các dơi nhỏ, ếch và chim, chúng ăn những con mồi lượm lặt được từ các nhánh cây hoặc trên mặt đất. Để tìm con mồi, chúng thường dựa vào những âm thanh phát ra từ con mồi như tiếng sột soạt của lá khô, tiếng gọi tìm bạn khác phái của loài dế, hoặc có thể là những tiếng gọi định vi bằng âm thanh của các loài dơi khác.', NULL, ' Loài dơi này được tìm thấy khắp vùng Đông Nam Á như Việt Nam, Thái Lan, Lào, Indonesia, Borneo và Philippin và còn phân bố trên khắp lục địa nhưng không sống trên các đảo.', NULL, NULL, 'Loài hiếm gặp, có giá trị nghiên cứu khoa học, thẩm mỹ và tiêu diệt các loài côn trùng gây hại trong thiên nhiên.', NULL, NULL, NULL, 'VnCreature'),
(4391, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Megadermatidae', 'Dơi Ma', 'FAM_233', 'Megaderma', NULL, 'GEN_1175', 'megadermaspasma', 'Megaderma spasma', '(Linnaeus, 1758)            ', 'Dơi ma nam', 'SPA_04428', ' trong họ Dơi ma Megadermatidae được phân biệt bởi lỗi tai lớn kết nối với nhau ngang lông mày, ngủ nhỉ thon dài chỉ ra thành hai thùy không bằng nhau, một mũi nhọn ra, và một cú vỗ giữa không có kết nối với cẳng chân. Dơi ma nam Megaderma co thắt là loại vi khuẩn có kích thước trung bình. Dài cẳng tay 54 - 61m, nặng 20 - 30g. Có một lá mũi trung gian lớn và các cạnh lồi tới lá mũi phía sau. Mặc dù có tên gọi là batman ma, barbart này không hút máu, không giống các loại batman ma thực sự được tìm thấy ở Châu Mỹ. Thức ăn của chúng chủ yếu là các động vật chân đốt, nhưng người ta cũng ghi nhận là nó ăn các con dơi nhỏ bị bẫy hơn nữa chúng ăn những con cú đánh lặt được từ các nhánh cây hoặc trên mặt đất. Để tìm kiếm, chúng tôi thường dựa vào những âm thanh phát ra từ con rối như tiếng ồn ào của lá khô, tiếng gọi tìm bạn khác của các nhóm dế, hoặc có thể là những tiếng gọi định nghĩa bằng âm thanh của các loài Other.', NULL, ' ', NULL, NULL, 'Có giá trị nghiên cứu khoa học, thẩm mỹ và tiêu diệt các loại côn trùng gây hại trong thiên nhiên.', NULL, NULL, NULL, 'VnCreature'),
(4392, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Megadermatidae', 'Dơi Ma', 'FAM_233', 'Megaderma', NULL, 'GEN_1175', 'megadermatheobaldi', 'Megaderma theobaldi', 'Dobson,1872', 'Dơi ma Bắc', 'SPA_04429', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4393, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Molossidae', 'Dơi Thò Đuôi', 'FAM_245', 'Chaerephon', NULL, 'GEN_0354', 'chaerephonplicatus', 'Chaerephon plicatus', '(Buchannan, 1800)', 'Dơi thò đuôi', 'SPA_04430', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4394, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Acerodon', NULL, 'GEN_0018', 'acerodonmacklotii', 'Acerodon macklotii', 'Temminck,1837', 'Dơi mật hoa lớn', 'SPA_04431', 'Đầu — thân 230 mm (không có đuôi), tai 32 - 34 mm, chân sau 46 mm, cẳng tay 139 - 148 mm; trọng lượng 518 g (trung bình). Chiều dài lớn nhất của hộp sọ là 69 - 72 mm. Phân loài alorensis lớn hơn và có chiều dài cẳng tay là ¢. 156 mm. Đôi mắt của Sunda Flying Fox rất to, có tròng mắt màu nâu vàng nhạt. Các phân loài khác nhau rất nhiều về màu sắc của bộ lông nhưng nhìn chung có nhiều sắc thái khác nhau của màu nâu sô-cô-la, với hai bên đầu sẫm màu hơn vương miện và lớp áo choàng vàng. Con đực và con cái có màu lưỡng sắc, và con cái nhìn chung nhạt màu hơn đáng kể. Mông và đùi có màu nâu sẫm nhất, thỉnh thoảng có những đốm vàng. Gốc lông có màu nâu sẫm đến nâu hổ phách, có một số đầu màu vàng và có lông màu bạc. Con đực có chùm lông cổ tuyến có màu nâu vàng, với bộ lông xung quanh nhạt màu hơn và phần gốc màu nâu đỏ đậm. Lông nói chung là len. Uropatagium bị giảm; calcar nhỏ. Màng cánh có màu nâu sẫm đến đen và bắt nguồn từ các bên của cơ thể, phía trên mặt phẳng giữa một chút. Hộp sọ là loại pteropine điển hình và có độ chắc vừa phải, với mõm ngắn hẹp, quỹ đạo nhỏ, mào dọc thấp rộng và hàm dưới khá dày', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.gbif.org/occurrence/4442404968'),
(4395, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Cynopterus', NULL, 'GEN_0532', 'cynopterusbrachyotis', 'Cynopterus brachyotis', '(Muller, 1838)            ', 'Dơi chó tai ngắn', 'SPA_04432', 'Cynopterus brachyotis (tên tiếng Anh: Dơi chó tai ngắn) là một loài động vật có vú trong họ Dơi quạ, bộ Dơi. Loài này được Müller mô tả năm 1838.[2] Loài dơi này sinh sống ở Nam Á và Đông Nam Á. Chúng ăn trái cây.', NULL, NULL, NULL, NULL, NULL, NULL, 'LC', NULL, 'https://www.inaturalist.org/taxa/40793-Cynopterus-brachyotis'),
(4396, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Cynopterus', NULL, 'GEN_0532', 'cynopterushorsfieldi', 'Cynopterus horsfieldi', 'Gray, 1843', 'Dơi chó mũi ống ', 'SPA_04433', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4397, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Cynopterus', NULL, 'GEN_0532', 'cynopterussp', 'Cynopterus sp', NULL, 'Dơi quả', 'SPA_04434', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4398, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Cynopterus', NULL, 'GEN_0532', 'cynopterussphinx', 'Cynopterus sphins', '(Vahl, 1797)', 'Dơi chó cánh dài', 'SPA_04435', 'Những con dơi này có mõm tương đối dài. Phần trên của chúng có màu nâu đến nâu xám với phần dưới nhạt màu hơn. Lông rất mịn và mượt. Tai và xương cánh của C. nhân sư có viền màu trắng. Răng má dưới tròn không có múi phụ. Sải cánh của con trưởng thành khoảng 48 cm. Con non nhẹ hơn con trưởng thành. Chiều dài cẳng tay trung bình 7,2mm (64-79mm).', NULL, 'Nó được tìm thấy ở Pakistan, Bangladesh, Bhutan, Campuchia, Trung Quốc, Ấn Độ, Indonesia, Lào, Malaysia, Myanma, Philippines, Sri Lanka, Thái Lan và Việt Nam', NULL, NULL, NULL, NULL, 'LC', NULL, 'https://www.thainationalparks.com/species/greater-short-nosed-fruit-bat'),
(4399, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Eonycteris', NULL, 'GEN_0653', 'eonycterisspelaea', 'Eonycteris spelaea', '(Dobson, 1871)', 'Dơi quả lưỡi dài', 'SPA_04436', 'có đôi mắt to, đôi tai nhỏ, đơn giản và không có vành tai. Mõm hẹp, lưỡi dài và có thể kéo dài ra, có các nhú giống như quả mâm xôi. Bộ lông lưng có màu nâu sẫm và bụng nhạt màu hơn. Cổ của con đực được bao phủ bởi những sợi lông dài \"osmetrichia\" có mùi thơm, sẫm màu hơn phần xương của đầu và cơ thể. Ngón thứ hai độc lập và không có móng vuốt. Răng dạng mol nhỏ đi đáng kể và hầu như không nhô ra ngoài nướu. Công thức nha khoa ở Eonycteris là i 2/2, c 1/1, pm 3/3, m 2/3 x 2 = 34. Loại lưỡi, chiều dài đuôi từ 12 đến 33 mm và không có ngón trỏ móng vuốt phân biệt Eonycteris . ( Kunz và Fenton, 23 ; Macdonald, 21 ; McNab, 1989 ; Nowak, 1999 )', NULL, 'Eonycteris spelaea , được tìm thấy ở hầu hết Nam Á, từ miền nam Trung Quốc đến các đảo của Indonesia, và từ tây nam Ấn Độ đến khắp Philippines. (Nowak, 1999 ; Wilson và Reeder, 25)', NULL, NULL, NULL, NULL, 'LC', NULL, 'https://animaldiversity.org/accounts/Eonycteris_spelaea/'),
(4400, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Macroglossus', NULL, 'GEN_1139', 'macroglossusspelaeus', 'Macroglossua spelaeus', '(Dobson,1781)', 'Dơi cáo', 'SPA_04437', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4401, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Macroglossus', NULL, 'GEN_1139', 'macroglossusminimus', 'Macroglossus minimus', '(É. Geoffroy, 1810)', 'Dơi ăn mật hoa lớn', 'SPA_04438', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4402, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Macroglossus', NULL, 'GEN_1139', 'macroglossussobrinus', 'Macroglossus sobrinus', 'K. Andersen, 1911           ', 'Dơi ăn mật hoa lớn', 'SPA_04439', ' Đầu thân 7 - 89 mm, đuôi ¢.  - 6 mm, tai 14 - 19 mm, chân sau 1 - 18 mm, cẳng tay 38 - 52 mm; trọng lượng 18 - 29 g. Dơi hoa lưỡi dài hơn rất giống với Dơi hoa lưỡi dài hơn (M. minimus) nhưng có thể được phân biệt bằng cách nhìn chung lớn hơn với mõm dài hơn, cằm nổi bật hơn, lỗ mũi hơi hướng về phía trước và không có rãnh ở môi trên. Đầu và mõm thon dài, lưỡi có nhú rất dài, lỗ mũi tròn và hướng về phía trước. Bộ lông lưng có màu từ đất sét đến màu nâu nhạt, có lông ở gốc màu nhạt; phần bụng bụng nhạt màu và xám hơn, gần như màu kem. Tai tương đối dài, tròn và có màu nâu sẫm; đôi mắt to, có tròng đen màu nâu sẫm. Đuôi rất nhỏ và khó nhìn thấy hoặc thiếu hoàn toàn. Uropatagium có tính khử cao, gắn ở gốc nơi có đuôi và theo chân đến mắt cá chân nơi nó gắn vào lớp vôi hóa có tính khử cao. Ngón thứ hai của cánh có móng vuốt, xương bàn tay thứ ba và thứ năm có kích thước không bằng nhau, cánh có màu sẫm với lông mọc dài trên cánh tay trên ở mặt lưng và bụng', NULL, 'Phạm vi của nó bao gồm một số quốc gia ở châu Á, bao gồm Campuchia, Trung Quốc, Ấn Độ, Indonesia, Lào, Malaysia, Myanmar, Thái Lan và Việt Nam.', NULL, NULL, NULL, NULL, 'LC', NULL, 'https://www.gbif.org/species/5218626'),
(4403, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Megaerops', NULL, 'GEN_1176', 'megaeropsecaudatus', 'Megaerops ecaudatus', '(Temminck 1837)', 'Dơi quả đuôi cụt nhỏ', 'SPA_04441', 'Đầu — thân 65 - 84 mm (không có đuôi), tai 12: 9 - 18 mm, chân sau 8 - 9 — 11 - 2 mm; cẳng tay 50 - 58 mm; trọng lượng 22 - 28 g.  Dơi quả không đuôi  lỗ mũi nhô ra và đôi mắt to. Con đực nhỏ hơn con cái một chút. Mõm ngắn, rộng sâu và dày, có lỗ mũi hình ống và nhân trung rõ rệt. Mắt to và lồi; mống mắt có màu nâu ấm. Tai dài và hình bầu dục, có vành tai màu nâu nhạt trong mờ và vành tai sẫm màu hơn, hơi thuôn lại ở mỗi phút. Mặt ít có lông. Bộ lông mềm, màu nâu nhạt đồng đều với phần gốc lông màu xám ở đầu và thân, chỉ nhạt màu hơn một chút ở phần bụng và dài hơn ở cổ họng, có thể hình thành những lớp lông xù không rõ ràng ở con đực, xương gót ngắn, xương chày ngắn và hơi có lông ở mặt lưng. Có móng vuốt. Màng cánh có màu nâu, từ hai bên cơ thể và dính vào ngón chân cái. Hộp sọ không có độ lệch cơ bản và mõm sâu đặc trưng; mũi và phần trước hàm trên tạo hình lỗ mũi được tạo ra phía trước dưới dạng một ống ngắn và hình trái tim khi nhìn từ trên xuống. ừng lá rộng ẩm nhiệt đới, bao gồm rừng mưa nhiệt đới bán thường xanh Tenasserim-Nam Thái Lan và rừng nhiệt đới vùng đất thấp và vùng núi.  Loài di cư. Con cái mang thai chủ yếu vào tháng 2 nhưng cũng có thể vào tháng 3 - tháng 5 và tháng 6. Những con non được quan sát thấy vào tháng 11.  Kiếm ăn theo đàn ở những cây ăn quả với cây trồng lớn. Nó kiếm ăn ở tất cả các tầng bên dưới tán nhưng phổ biến hơn ở các tán phụ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Gbif'),
(4404, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Megaerops', NULL, 'GEN_1176', 'megaeropsniphanae', 'Megaerops niphanae', 'Yenbutra&Felten, 1983            ', 'Dơi quả ni pha', 'SPA_04442', 'Dơi có kích thước trung bình, dài thân 82 - 90mm, đuôi cụt, dài cánh tay 58 - 62mm, độ dài cánh tay khoảng 14, bề dài lớn nhất của so 27,7 - 28,2, cung gò má rộng 17,8 -18,3, hàm dài 10,2 - 10,5. Loài dơi này có môi trên không hướng về vành ngoài miệng. Phần mũi hơi dốc tới đỉnh. Mũi ngắn và tròn, nhìn nghiêng hình 4 cạnh, không có cạnh nào song song. Ở giữa ổ mắt không phình ra và rãnh không sâu. Đặc điểm phân biệt với loài Dơi chó ấn độ Cynopterus sphinx là loài này có kích thước nhỏ hơn, mép tai và các ngón không có màu trắng. Mõm ngắn, rộng bản Thức ăn chủ yếu của chúng là mật hoa và phấn hoa, và là tác nhân thụ phấn chính của các cây rừng bao gồm các loài cây thương mại quan trọng như: Sầu riêng Durio zibethinus, Bông gạo Gossampinus malabarica và cây Đước Rhizophora sp. Thường sống tụ tập thành đàn trong bọng cây. Có thể di chuyển trong bán kính 30km từ nơi trú ngụ tới nơi tìm thức ăn. Là tác nhân phát tán các loài hạt giống và phấn hoa', NULL, 'Việt Nam loài này có ở Vĩnh Phúc ( Tam Đảo), Kontum (Đắc Tô), Lâm Đồng Danar, Ninh Thuận (Nha Hố), Đồng Nai (Tân Phú), Sóc Trăng, TP Hồ Chí Minh (Cần Giờ). Được tìm thấy trên khắp Đông nam Á, bao gồm Sulawesi và Philipin, Thái Lan, Việt Nam.', NULL, NULL, 'Loài hiếm gặp, có giá trị nghiên cứu khoa học, thẩm mỹ và là tác nhân thụ phấn và phát tán hạt giống cho các loài thực vật có hoa trong thiên nhiên.', NULL, NULL, NULL, 'VnCreature'),
(4405, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Pteropus', NULL, 'GEN_1678', 'pteropusleschenaultii', 'Pteropus leschenaultii', 'Desmarest, 1820.', 'Dơi ngựa nâu', 'SPA_04444', 'Dài cẳng tay: 78 - 87mm. Là loài dơi quả có kích cỡ trung bình, cân nặng từ 60 - 80g. Mõm tương đối nhỏ và đuôi ngắn. Lông ngắn màu xám nhạt hoặc nâu. Con đực trưởng thành có các chùm lông màu vàng nhạt hoặc màu cam gồm các lông dài hơn trên vai. Thường trú trong hang, là loài dơi quả định vị bằng âm thanh. Chúng phát ra âm thanh như tiếng chách lưỡi nghe rất rõ, nhờ vào âm thanh đó chúng có thể tìm lối vào và nơi để đậu trong các hang động tối', NULL, 'Dơi ngựa nâu có mặt trên khắp các khu vực Đông Nam Á tới tận miền Đông Sulawesi. ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=6012'),
(4406, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Pteropus', NULL, 'GEN_1678', 'pteropuslylei', 'Pteropus lylei', 'K.Andersen, 1908', 'Dơi ngựa Thái Lan ', 'SPA_04445', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4407, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Pteropus', NULL, 'GEN_1678', 'pteropusvampyrus', 'Pteropus vampyrus', '(Limmaeus, 1758)', 'Dơi ngựa lớn', 'SPA_04446', 'Dơi ngựa lớn là loài dơi lớn nhất trong họ Dơi quả Pteropodidae và là một trong những loài dơi có kích thước lớn nhất thế giới. Kích thước cẳng tay dài 185 - 225mm, chiều dài thân đầu 276 - 339mm, chiều dài chân, móng 52 - 75mm, dài đuôi 0, trọng lượng 645 - 1.100g. Dơi trưởng thành lông đồng màu nâu xám, cổ và vai vàng nâu hay vàng sẫm. Lông phần lưng phía trên phần vai và cổ dài hơn nửa phần dưới. Lông bụng thô và to. Các con non có màu nâu xám mờ. Sống thành đàn lớn trên cành cây ở rừng ngập mặn (cây họ Đước Rhizophoraceae). Chúng thường bay những quãng đường dài để tìm thức ăn. Kiếm ăn vào ban đêm ban ngày treo mình ngủ trên cành cây. Thức ăn chủ yếu của loài này là quả hoặc mật hoa như chôm chôm, xoài, sầu riêng... Chúng là tác nhân thụ phấn hoa của nhiều loài cây rừng và cây ăn quả.\nMùa sinh sản bắt đầu mang thai từ tháng 10 đến tháng 11 hàng năm. Con non sinh vào tháng 3 đến tháng 5 hàng năm. Mổi năm đẻ một lứa, mỗi lứa đẻ một con.', NULL, 'Việt Nam loài này khá phổ biến ở U Minh, Kiên Giang và chùa Dơi (Sóc Trăng). Phía Nam Miến Điện, Thái Lan, Indônêxia, bán đảo Mã Lai, Philipin, Java, Borneo ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(4408, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Rousettus', NULL, 'GEN_1761', 'rousettusamplexicaudatus', 'Rousettus amplexicaudatus', 'É. Geoffroy, 1810', 'Dơi ngựa đuôi lớn', 'SPA_04447', 'Đầu - thân 128 - 154 mm, đuôi 13 - 24 mm, tai 16 - 5 - 24 mm, chân sau 19 - 21 mm, cẳng tay 70 - 92 mm; trọng lượng 64 - 106 g. Trung bình con đực luôn lớn hơn con cái. Tai hẹp, đầu không bị suy giảm, vành tai nhỏ và tròn. Màu lông tương tự như các loài khác: thường có màu nâu và xám xám trên ngực, ức và bụng. Một dải lông lưng riêng biệt, rộng 15 - 35 - 5 mm.  Màng cánh có màu nâu sẫm nhưng gần như mờ trên xương tạo nên các sọc trắng. Móng vuốt hiện diện ở ngón trỏ. Các đường gờ ở vòm miệng có thể thay đổi tùy theo từng loài.  Rừng nguyên sinh và thứ sinh, đất nông nghiệp hỗn hợp (vườn cây ăn trái) và các khu vực trống, từ mực nước biển đến độ cao 2200 m', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Gbif.org'),
(4409, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Rousettus', NULL, 'GEN_1761', 'rousettusleschenaulti', 'Rousettus leschenaulti', '(Desmarest, 1820).', 'Dơi ngựa nâu', 'SPA_04448', 'Dài cẳng tay: 78 - 87mm. Là loại xà lách có kích thước trung bình, cân nặng từ 60 - 80g. So sánh nhỏ và đuôi ngắn. Lông ngắn màu xám nhạt hoặc nâu. Con đực trưởng thành có các cụm lông màu vàng nhạt hoặc cam gồm các lông dài hơn trên vai. Thường trú trong hang, là loại vi khuẩn định vị bằng âm thanh. Chúng tôi phát ra âm thanh như tiếng lịch sự nghe rất rõ ràng, nhờ vào âm thanh mà chúng tôi có thể tìm đường vào và nơi để đậu trong hang động tối Ăn chủ yếu của loài này là trái cây và mật hoa , Sống trong các hang động tối hoặc trong các thân cây lớn trống rỗng.', NULL, ' Dơi nâu có mặt trên khắp các khu vực Đông Nam Á tới tận dụng miền Đông Sulawesi. ', NULL, NULL, 'Có giá trị nghiên cứu khoa học, thẩm mỹ và là tác nhân thụ phấn cho các loài thực vật trong thiên nhiên.', NULL, NULL, NULL, 'VnCreature'),
(4410, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Rousettus', NULL, 'GEN_1761', 'rousettussp', 'Rousettus sp.', NULL, 'Dơi cáo', 'SPA_04449', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4411, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Pteropodidae', 'Dơi Quả', 'FAM_308', 'Sphaerias', NULL, 'GEN_1839', 'sphaeriasblanfordi', 'Sphaerias blanfordi', '(Thomas, 1891)            ', 'Dơi quả núi cao', 'SPA_04450', 'Đầu thân 75 - 90 mm (không có đuôi), tai 17 - 22 mm, chân sau 12 - 16 mm, cẳng tay 52 - 61 mm; trọng lượng trung bình 31 g. Dơi quả có lỗ mũi khác nhau, mõm nhọn và ít nhú ở môi trong. Mắt có kích thước trung bình; mống mắt có màu nâu cam sẫm. Tai có hình bầu dục, vành giữa có viền hẹp với thùy tai nhỏ hình tam giác, màu trắng và chống tai. Phần đầu có màu xám nâu. Bộ lông lưng dài, mềm, mịn như len và có màu xám nâu, kéo dài đến màng cánh tay và cánh, dày đến tận chân sau.  Phần cổ họng có màu nâu và lưỡng hình giới tính, con đực sở hữu các đốm lông màu vàng xám ở mỗi bên. Ngực và bụng có màu xám, và bộ lông mềm nhưng ngắn hơn ở lưng và dài hơn và có lông tơ kéo dài đến cẳng tay, mặt bụng của màng cánh và mặt dưới của chân sau. Màng cánh màu xám, dính ở ngón chân cái; móng vuốt hiện diện. Hộp sọ rất mỏng manh; mõm mỏng và thuôn nhọn; hàm nghiêng về phía trước; gò má mỏng và thẳng; hộp sọ hình cầu, lệch về phía bụng; các hốc cạnh mũi hầu như không phồng lên và ngắn, không đạt được các quá trình sau ổ mắt ngắn; và lỗ sau ổ mắt không có. Hàm dưới mỏng, vành răng dốc, lồi cầu nằm dưới đường xương ổ răng và góc tròn. Môi trường sống. Rừng sương mù và gió mùa, rừng lá rộng thường xanh ẩm ướt, rừng hỗn loài và bìa rừng ở độ cao 300 - 2700 m.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Gbif.org'),
(4412, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Rhinolophidae', 'Dơi Lá Mũi', 'FAM_321', 'Rhinolophus', NULL, 'GEN_1732', 'rhinolophusaffinis', 'Rhinolophus affinis', 'Horsfield. 1823            ', 'Dơi lá đuôi', 'SPA_04451', 'Dơi có kích thước trung bình, thân dài 58 - 63mm, cẳng tay dài 49 - 54mm, đuôi dài 22 - 26mm, sọ dài 19,8 - 22,6mm. dài tai 21 - 25mm (24 mẫu ở bán đảo Mã Lai). Trọng lượng 12,5g. Phần thân trên màu nâu đậm chuyển sang nâu đỏ hung; phần thân dưới hơi nhạt hơn. Lỗi tai phải vừa phải. Lá mũi đơn giản không có cánh phụ trên cánh mũi; mô thịt nối tiếp rộng và tròn, bắt đầu từ bên dưới đỉnh của cánh mũi, tạo thành một khía cạnh V mảnh. Sống trong hang động. Tìm kiếm thức ăn nơi các tầng đất thấp trong rừng thường xanh núi cao hoặc rừng núi đá vôi.', NULL, 'Việt Nam: tìm thấy ở Lào Cai (Sapa) Lạng Sơn, Ninh Bình, Lâm Đồng Thế giới: từ Ấn Độ sang Trung Quốc, Đông Nam Á, đảo Sumatra, Java, Borneo.', NULL, NULL, 'có giá trị nghiên cứu khoa học và tiêu diệt các loại côn trùng gây hại trong thiên nhiên.', NULL, NULL, NULL, 'VnCreature'),
(4413, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Rhinolophidae', 'Dơi Lá Mũi', 'FAM_321', 'Rhinolophus', NULL, 'GEN_1732', 'rhinolophusborneensis', 'Rhinolophus borneensis', 'Peters, 1861', 'Dơi lá sa đen', 'SPA_04452', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4414, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Rhinolophidae', 'Dơi Lá Mũi', 'FAM_321', 'Rhinolophus', NULL, 'GEN_1732', 'rhinolophuslepidus', 'Rhinolophus lepidus', 'Blyth,1844', 'Dơi lá nhỏ', 'SPA_04453', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4415, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Rhinolophidae', 'Dơi Lá Mũi', 'FAM_321', 'Rhinolophus', NULL, 'GEN_1732', 'rhinolophusluctus', 'Rhinolophus luctus', 'Temminck, 1834', 'Dơi lá lớn', 'SPA_04454', 'Bộ lông dài và mịn. Lông lưng có màu nâu xám. Lông bụng có màu xám hoặc xám trắng. Con non có màu sẫm hơn con trưởng thành. Đây là loài dơi móng ngựa lớn nhất và thường có thể nhận biết được qua kích thước của nó. Chiều dài cẳng tay 58,0-80,5mm Thường làm tổ trong hang động, đôi khi trong các thân cây rỗng. Thường làm tổ trong hang động, đôi khi trong các thân cây rỗng ', NULL, ' Ấn Độ, Nepal và Myanmar đến miền nam Trung Quốc và phía nam đến Việt Nam, Lào, Thái Lan, bán đảo Malaysia và Indonesia', NULL, NULL, NULL, NULL, NULL, NULL, 'bio.bris.'),
(4416, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Rhinolophidae', 'Dơi Lá Mũi', 'FAM_321', 'Rhinolophus', NULL, 'GEN_1732', 'rhinolophusmacrotis', 'Rhinolophus macrotis', 'Blyth, 1844            ', 'Dơi lá ', 'SPA_04455', 'Dơi có kích thước nhỏ. Thân dài 38mm, đuôi dài khoảng 14mm, dài cẳng tay 37 - 41mm, tai dài 19 - 22mm, bàn chân dài 8,2 - 9,2mm, sọ dài 17,5 - 18,2mm, hàm dài 6,3 - 6,8mm. Thuỳ liên kết cao vượt quá bề cao của yên ngựa. Bò của lá mũi giữa mở rộng tất cả cùng với bờ của yên ngựa.Yên ngựa rộng và bờ song song với lông dài, rậm phủ mặt trước. Lá mũi trước phủ môi trên. Lông ngắn không mịn Loài này thường sống trong hang đá, đường hầm, và thường sống chung với loài dơi lá lớn Rhinolophus luctus (Blandford 1888). Thường rời hang đi kiếm ăn vào lúc trời tranh sáng, tranh tối. Bay nhanh và bay với tốc độ rất cao để bắt các loài côn trùng (bọ cánh cứng, hai cánh)  vào mùa mưa', NULL, 'Việt Nam loài này tìm thấy Lào Cai, Nam Hà. Các loài này được tìm thấy trong tất cả các nơi của vùng Đông Nam châu Á từ Thái Lan, Lào, Việt Nam đến Malaysia, Philippin, Borneo.', NULL, NULL, 'Loài hiếm gặp, có giá trị nghiên cứu khoa học, thẩm mỹ và tiêu diệt các loài côn trùng gây hại trong thiên nhiên.', NULL, NULL, NULL, 'VnCreature'),
(4417, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Rhinolophidae', 'Dơi Lá Mũi', 'FAM_321', 'Rhinolophus', NULL, 'GEN_1732', 'rhinolophusmalayanus', 'Rhinolophus malayanus', 'Bonhote, 1903            ', 'Dơi lá Mã lai', 'SPA_04456', 'Dơi có kích thước nhỏ. Thân dài 40 - 50mm, đuôi dài khoảng 18 - 25mm, dài cẳng tay < 43mm, đuôi dài 16 - 19mm, bàn chân dài 9 - 10mm, hộp sọ dài 18,3mm, hàm dài 6,7mm, ôm má rộng khoảng 8 ,7mm. Lá mũi sau thu gọn, đỉnh cao kéo dài. Phần mũi giữa và sau62ng lên. Phần trên ổ mắt lồi xuống, không kéo dài từ trước đến sau của phần giữa và trước tuy lồi lên nhưng bị giới hạn bởi phần trước đến chỗ nối của phần trên ổ mắt. Hướng nghiêng phần giữa và trước lồi lên hơi nông, phần sau lồi xuống. Loài này thường sống trong hang đá, đường hầm và thường sống thành đàn lên đến hàng trăm cá thể. Thường rời bỏ hang đi kiếm ăn vào lúc chiều tối. Bay nhanh và bay với tốc độ rất cao để bắt các loài côn trùng (bọ cánh cứng, hai cánh) vào mùa mưa', NULL, 'Việt Nam loài này được tìm thấy ở Lai Châu (Mường Muôn) Loài này được tìm thấy ở tất cả các nơi thuộc vùng Đông Nam châu Á từ Thái Lan, Lào, Việt Nam đến Malaysia, Philippin, Borneo', NULL, NULL, ' có giá trị nghiên cứu khoa học và tiêu diệt các loại côn trùng gây hại trong thiên nhiên.', NULL, NULL, NULL, 'VnCreature'),
(4418, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Rhinolophidae', 'Dơi Lá Mũi', 'FAM_321', 'Rhinolophus', NULL, 'GEN_1732', 'rhinolophusmarshalli', 'Rhinolophus marshalli', 'Thonglongya, 1973            ', 'Dơi lá Ma sa', 'SPA_04457', 'Dơi cỡ nhỏ, dài thân 42mm, dài đuôi 20mm, dài cánh tay 44 - 47mm. dài tai 2,8mm, dài bàn chân 9,5mm, dài sọ 19,3mm, cung gò má rộng 9,1mm, dài hàm 6,3mm, răng cửa trên nhỏ. Răng cửa dưới chia ba. Nếp gian mũi hình bốn cạnh, không có cạnh nào song song với bờ mở rộng thành cánh. Lá mũi sau gần giống hình tam giác, vòng quanh ở trên, ẩn dấu dưới yên ngựa. Nền của yên ngựa mở rộng một cách bất ngờ bằng bề rộng nếp gian mũi. Đối mấu tai bằng một nửa bề dài của tai. Loài này thu mẫu ở khu rừng khô thay lá gần ruộng lúa. Thường đậu trong các hang động và đường hầm, thức ăn của loài này là Muỗi và Côn trùng phân bố trong khu vực.', NULL, 'Việt Nam: loài này phân bố ở Lào Cai, Hà Nam, Bắc Thái, Vĩnh Phú Thế giới: Thái Lan, Malaysia.', NULL, NULL, 'Loài hiếm, có giá trị nghiên cứu khoa học và tiêu diệt các loài côn trùng gây hại trong', NULL, NULL, NULL, 'VnCreature'),
(4419, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Rhinolophidae', 'Dơi Lá Mũi', 'FAM_321', 'Rhinolophus', NULL, 'GEN_1732', 'rhinolophusparadoxolophus', 'Rhinolophus paradoxolophus', '(Bourret, 1951)', 'Dơi lá quạt', 'SPA_04458', 'Lông mặt lưng màu nâu sẫm, phần ngọn sợi lông nhạt màu hơn phần thân và phần gốc. Lông mặt bụng màu xám khói. Cằm và ngực màu xám nhạt. Loa tai to và có dạng hình phễu. Mấu tai cao, hẹp, có các cạnh gần như song song với nhau và đỉnh uốn tròn.Se-la rất cao và có đỉnh uốn tròn. Thuỳ liên kết thấp và kém phát triển. Dơi lá quạt thường sống theo đàn, trú ngụ dưới tán cây, hang động, khe đá...Kiếm ăn bằng cách săn bắt côn trùng xung quanh các cây to, bụi rậm, dọc theo lối mòn...', NULL, ' Trong nước: Lào Cai, Tuyên Quang, Lạng Sơn và Bắc Kạn, Ninh Bình, Quảng Bình,', NULL, 'loài đặc hữu Đông nam Á, chỉ ghi nhận được ở Việt Nam và Đông Bắc Thái Lan.', 'Là loài dơi hiếm', 'VU', 'VU', NULL, 'VnCreature'),
(4420, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Rhinolophidae', 'Dơi Lá Mũi', 'FAM_321', 'Rhinolophus', NULL, 'GEN_1732', 'rhinolophuspearsonii', 'Rhinolophus pearsoni', '(Horsfield, 1851)', 'Dơi lá Pec xôn', 'SPA_04459', ' Lông lưng màu nâu. Lông bụng nhẹ hơn lông lưng. Con non có màu xám hơn con trưởng thành. Chiều dài cẳng tay trung bình 47,0-56,0mm. Móng ngựa lớn, quá trình kết nối được làm tròn. Phần ba cơ bản của sella rộng. Môi dưới có một rãnh duy nhất. Khối lượng cơ thể 13,2-21,8 g ', NULL, ' Được tìm thấy ở phía bắc Ấn Độ, Nepal, Myanmar tới Trung Quốc, Việt Nam, Lào và Thái Lan', NULL, NULL, NULL, NULL, NULL, NULL, 'University of Bristol'),
(4421, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Rhinolophidae', 'Dơi Lá Mũi', 'FAM_321', 'Rhinolophus', NULL, 'GEN_1732', 'rhinolophuspusillus', 'Rhinolophus pessillus', 'Temminck 1834', 'Dơi lá mũi nhỏ', 'SPA_04460', ' Lông lưng màu nâu sẫm. Lông bụng có màu trắng xám. Con non có màu xám hơn con trưởng thành. Nó là một con dơi móng ngựa rất nhỏ. Chiều dài cẳng tay 33,5-4,mm. (Csorba và cộng sự 23). Chiều dài cẳng tay ở Trung Quốc trung bình là 36,9 +/- 1,4 mm (SD) đối với nam giới (n = 17; phạm vi 35,1-4,2 mm); 37,2 +/- 1,5 mm đối với con cái (n = 8, khoảng 34,9-4,2 mm) (Li và cộng sự 26).', NULL, 'trải dài khắp Ấn Độ, Nepal, Myanmar, Việt Nam, Thái Lan, Malaysia và Indonesia (Csorba et al. 23). Sự phân bổ của Trung Quốc được thể hiện bằng các dấu chấm trên bản đồ bên dưới (được đưa ra bởi Zhang và cộng sự 1997).', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.bio.bris.ac.uk/research/bats/China%20bats/rhinolophuspusillus.htm'),
