(4424, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Rhinolophidae', 'Dơi Lá Mũi', 'FAM_321', 'Rhinolophus', NULL, 'GEN_1732', 'rhinolophussp', 'Rhinolophus sp', NULL, 'Dơi lá mũi ', 'SPA_04463', 'Lông mặt lưng màu nâu sẫm, phần ngọn sợi lông nhạt màu hơn phần thân và phần gốc. Lông mặt bụng màu xám khói. Cằm và ngực màu xám nhạt. Loa tai to và có dạng hình phễu. Mấu tai cao, hẹp, có các cạnh gần như song song với nhau và đỉnh uốn tròn.Se-la rất cao và có đỉnh uốn tròn. Thuỳ liên kết thấp và kém phát triển.', NULL, 'rong nước: Lào Cai, Tuyên Quang, Lạng Sơn và Bắc Kạn, Ninh Bình, Quảng Bình,', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5000'),
