(4426, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Rhinolophidae', 'Dơi Lá Mũi', 'FAM_321', 'Rhinolophus', NULL, 'GEN_1732', 'rhinolophussp2', 'Rhinolophus sp2', NULL, 'Dơi lá ', 'SPA_04465', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4427, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Rhinolophidae', 'Dơi Lá Mũi', 'FAM_321', 'Rhinolophus', NULL, 'GEN_1732', 'rhinolophusstheno', 'Rhinolophus stheno', 'Andersen, 1905', 'Dơi lá mũi nhỏ', 'SPA_04466', 'Bộ lông lưng màu nâu nhạt ở gốc, phía trên màu nâu đỏ. Môi dưới có 3 rãnh. Chiều dài cẳng tay 41-47,5 mm môi trường sống chính của chúng là rừng mưa nhiệt đới. Loài dơi này thường sống chung hang động với các loài dơi khác.', NULL, ' Thái Lan, Lào, Việt Nam, Bán đảo Malaysia, Sumatra, Java', NULL, NULL, NULL, NULL, NULL, NULL, 'bio.bris'),
(4428, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Rhinolophidae', 'Dơi Lá Mũi', 'FAM_321', 'Rhinolophus', NULL, 'GEN_1732', 'rhinolophusthomasi', 'Rhinolophus thomasi', 'Andersen,1905', 'Dơi lá tôma', 'SPA_04467', 'Thuỳ tam giác rất thấp, rộng và không nhọn. Thuỳ liên kết khía chữ ‘V’. Lá mũi trước nhỏ, hẹp. Bộ lông đồng màu nâu nhạt. Sợi lông có nửa gốc màu vàng nhạt và nửa ngọn màu nâu. Dơi lá tôma thường được ghi nhận trong những sinh cảnh gần sông, suối, ao, hồ...; trú ngụ trong các tán cây, hang, hẻm, các bụi tre, nứa..', NULL, 'Lai Châu, Lào Cai, Bắc Kạn, Ninh Bình, Thanh Hóa, Nghệ An và Đồng Nai. Mianma,Trung Quốc, Thái Lan.', NULL, NULL, 'Diệt muỗi và côn trùng gây hại. Có giá trị nghiên cứu khoa học và thẩm mỹ.', 'VU', NULL, NULL, 'vncreatures'),
(4429, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Rhinolophidae', 'Dơi Lá Mũi', 'FAM_321', 'Rhinolophus', NULL, 'GEN_1732', 'rhinolophusyannanensis', 'Rhinolophus yannanensis', '(Dobson, 1872)', 'Dơi lá đông á', 'SPA_04468', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4430, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Arielulus', NULL, 'GEN_0159', 'arielulusaureocollaris', 'Arielulus aureocollaris', '(Kock & Storch, 1996)', 'Dơi muỗi cổ vàng', 'SPA_04469', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4431, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Harpiocephalus', NULL, 'GEN_0825', 'harpiocephalusharpia', 'Harpiocephalus harpia', '(Temminck, 1840)', 'Dơi mũi ống cánh lông', 'SPA_04470', 'Mấu tai dài và hơi cong về phía trước. Phần mõm có lông che phủ (trừ lỗ mũi). Bộ lông dày và mềm. Mặt lưng: ngọn lông màu đỏ tươi, thân lông màu nâu da bò và gốc lông màu xám. Mặt bụng: ngọn lông màu nâu xám, thân và gốc lông sẫm màu hơn. Màng cánh và màng gian đùi đồng màu nâu. Có lông dài, màu hung đỏ che phủ ở mặt trên màng gian đùi, cánh và bàn chân. Lỗ mũi dạng ống.', NULL, 'Trong nước: Lào Cai, Quảng Bình, Quảng Trị. Thế giới: Ấn Độ, Mianma, Trung Quốc, Inđônêxia (Borneo), Philippin.', NULL, NULL, NULL, NULL, 'VU', NULL, 'https://vi.wikipedia.org/wiki/D%C6%A1i_c%C3%A1nh_l%C3%B4ng'),
(4432, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Ia', NULL, 'GEN_0946', 'iaio', 'Ia io', 'Thomas, 1902', 'Dơi I ô', 'SPA_04471', 'Lông lưng màu xám đen. Lông bụng có màu nâu hơn. Đây là một trong những loài dơi vespertilionid lớn nhất. Chiều dài cẳng tay trung bình là 74,1mm (khoảng 70,9-77,3mm) (Bates & Harrison, 1997). Mặt trần. Đôi tai rộng. Khối lượng cơ thể 49-63 g ở Ấn Độ. Loài này có đặc điểm phát sinh chủng loại Sống trong hang động, được tìm thấy ở độ cao > 1500m. Đây là loài dơi ăn thịt và ăn nhiều chim. Nó phát triển thói quen kiếm ăn đáng chú ý này một cách độc lập', NULL, '  Ấn Độ, Nepal, miền nam Trung Quốc, miền bắc Thái Lan, Lào và miền bắc Việt Nam', NULL, NULL, NULL, 'VU', 'LR', NULL, 'bris.ac'),
(4433, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Kerivoula', NULL, 'GEN_0996', 'kerivoulaflora', 'Kerivoula flora', 'Thomas, 1914', 'Dơi mũi nhẵn Su-đan', 'SPA_04472', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4434, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Kerivoula', NULL, 'GEN_0996', 'kerivoulahardwickii', 'Kerivoula hardwickii', '(Horsfield, 1824)', 'Dơi mũi nhẵn', 'SPA_04473', 'Dơi có kích thước rất nhỏ, dài cẳng tay 3,2 - 3,4mm, dài đuôi 44 - 47mm, dài tai 12 - 14mm, trọng lượng 3,5 - 4,2g (4 dơi mẫu). Tai thường to, không kéo dài đến lỗ mũi, khi đặt phía trước và dài 11 - 12mm. Phần thân trên màu nâu xám với chân lông màu xám đậm; phần thân dưới có màu nhạt hơn và xám hơn. Lỗ tai lớn vừa. Một dơi mẫu từ độ cao 1.500m trên núi Kinabalu (Borneo) và mẫu thu ở Đắc Lắc có kích thước khá lớn (dài cẳng tay 36,5mm, trọng lượng 5,2g) với lông xám đậm và có lẽ là đại diện cho loài dơi núi khác biệt. Thường ở tầng dưới của tầng cây cao. Trú trong các hốc cây và một lần đã phát hiện trong lá khô hình chén của cây Nắp ấm Nepenthes annamensis. Thức ăn và sinh sản  của loài này chưa được ghi nhận.', NULL, 'Loài này phân bố ở Đắc Lắc (Buôn mê Thuột) nhưng rất hiếm. Sri Lanka và Ấn Độ sang phía Nam Trung Quốc, Đông nam Á, Philipin, Sumatra, Java, Sulawesi và các đảo ở Indonesa và Borneo.', NULL, NULL, 'Loài hiếm gặp, có giá trị nghiên cứu khoa học, thẩm mỹ và tiêu diệt các loài côn trùng gây hại trong thiên nhiên.\n\n ', NULL, NULL, NULL, 'vncreatures.net'),
(4435, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Kerivoula', NULL, 'GEN_0996', 'kerivoulapapillosa', 'Kerivoula papillosa', 'Temminck, 1840', 'Dơi mũi nhẵn Java', 'SPA_04474', 'Dơi cỡ trung bình, dài thân 50mm. Lông lưng gốc đen và đỉnh nâu vàng nhạt, màu lông ở mặt lưng biến đổi ở các cá thể khác nhau từ màu nâu sẫm, đến màu nâu vàng sẫm.  Đôi khi có màu vàng sẫm gần cánh, mặt dưới nhạt hơn.\n\nDài đuôi 52,3mm, cánh tay >40mm, tai kéo dài đến lỗ mũi, khi đặt ở phía trước dài 14mm, ống tai với tai phụ nhọn dài có màu trắng trong.  Bàn chân dài 8,5mm, sọ > 15mm, cung gò mà rộng 11mm, hàm dài 12,7mm. Hai răng nanh trên và dưới (bên ngoài) đều dài 4,1 - 4,9mm. Răng nanh và răng hàm thứ 3 đều dài . 6,5mm 3 răng cửa trên và dưới rất phát triển Loài này sống thành tập đoàn trong hang động hay đường hầm, ống cống. Treo mình trên trần hang và thải phân xuống thành từng lớp dày. Thức ăn của loài này là các loài muỗi và côn trùng sống trong khu vực phân bố.', NULL, 'loài này phân bố ở Đắc Lắc (Buôn Mê Thuột). Ấn Độ, Mianma, Đông Dương, Indonesia, Malaysia', NULL, NULL, 'Loài hiếm gặp, có giá trị nghiên cứu khoa học, thẩm mỹ và tiêu diệt các loài côn trùng gây hại trong thiên nhiên.', NULL, NULL, NULL, 'vncreatures.net'),
(4436, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Kerivoula', NULL, 'GEN_0996', 'kerivoulapicta', 'Kerivoula picta', '(Pallas, 1767)', 'Dơi mũi nhẵn đốm vàng', 'SPA_04475', 'Màu sắc của Dơi mũi nhãn đốm vàng là màu cam sáng hoặc đỏ tươi, với đôi cánh màu đen và màu cam dọc theo các ngón tay. Giống như các loài Dơi mũi khác,  Dơi mũi nhãn đốm vàng  sở hữu bộ lông dài, len, khá xoăn, hình dáng nhỏ nhắn, mỏng manh, đôi tai lớn hình phễu và 38 chiếc răng. Chiều dài đầu và thân là 31-57mm. Chiều dài đuôi là 32-55 mm và chiều dài cẳng tay là 27-45 mm. thường trú ngụ trong các hốc và thân cây, tán lá, túp lều và các tòa nhà, nhưng cũng sống trong lá khô của cây nho và các loại cây khác, lá chuối và hoa', NULL, ' Miền nam và miền đông Ấn Độ đến miền nam Trung Quốc, Sri Lanka, Hải Nam đến Malaya, Sumatra, Java, Bali và Quần đảo Sunda và Molucca.', NULL, NULL, NULL, NULL, NULL, NULL, 'Animaldiversity'),
(4437, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Kerivoula', NULL, 'GEN_0996', 'kerivoulasp', 'Kerivoula sp.', NULL, 'Dơi mũi nhẵn', 'SPA_04476', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4438, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Miniopterus', NULL, 'GEN_1234', 'miniopterusaustralis', 'Miniopterus australis', '(Tomes, 1858)', 'Dơi cánh gập nhỏ', 'SPA_04477', 'Nó có màu đen xám, nhưng đổi màu trong năm thành màu nâu vàng. Nhìn kỹ hơn sẽ thấy một chiếc áo khoác có lớp lông bên dưới màu nâu nhạt phủ màu nâu sô cô la. Cả con đực và con cái đều lột xác. Tuy nhiên, con cái có xu hướng lột xác muộn hơn con đực vì chúng có thể đang cho con bú trong thời gian lột xác bình thường. Nó nặng từ 7 đến 8 g và có tổng chiều dài từ 86 đến 96 mm. Con đực và con cái không biểu hiện bất kỳ kiểu lưỡng hình nào; chúng có kích thước và trọng lượng tương đối giống nhau, ngoại trừ con cái mang thai sẽ tăng từ 2 đến 3 g. Đuôi dài bằng đầu và thân cộng lại (43 đến 48 mm), và lớp lông dày bao phủ gần hết đuôi. Cẳng tay của loài này có tổng chiều dài từ 36 đến 40 mm.  Sống trong các hang động, nhưng nó cũng được biết là đậu trong các mỏ, đường hầm, cống thoát nước, tòa nhà và hốc cây bị bỏ hoang. Sống về đêm, sống thành đàn', NULL, ' ndonesia, Philippines, New Guinea và Úc', NULL, NULL, NULL, NULL, NULL, NULL, 'Animaldiversity'),
(4439, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Miniopterus', NULL, 'GEN_1234', 'miniopterusfuliginosus', 'Miniopterus fuliginosus', '(Hodgson, 1835)', 'Dơi cánh dài', 'SPA_04478', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4440, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Miniopterus', NULL, 'GEN_1234', 'miniopterusmagnater', 'Miniopterus magnater', '(Maeda, 1982)', 'Dơi cánh khiên', 'SPA_04479', ' Đầu thân 58 - 75 mm, đuôi 52 - 64 mm, tai 11 - 17 mm, chân sau 9 - 13 mm, cẳng tay 48 - 54 mm; trọng lượng 11 - 3 - 21 - 3 g. Bộ lông của Dơi dài,dày, mềm, gần như đồng nhất màu đen đến nâu sẫm và không có màu ở mặt lưng; lông ở ngực có đầu màu nhạt trở thành màu nâu xám nhạt đồng đều ở bụng. Tai nhỏ, vành tai ngắn (5 - 7 mm), cùn và hơi cong về phía trước. Tất cả các vùng da tiếp xúc bao gồm cả màng có màu từ nâu đen đến đen Môi trường sống chính bao gồm các khu định cư của con người; mở đất; rừng thứ sinh bị xáo trộn với tre nứa; đồn điền ca cao, cà phê và chuối; và rừng nguyên sinh. Loài Dơi cánh khiên thường sống chung với các loài dơi sống trong hang động khác. Dơi ngón tay dài lớn thường kiếm ăn côn trùng bắt được khi bay trên các tán cây cũng như các con suối thấp và các vùng nước nhỏ. Nó kiếm ăn côn trùng xung quanh đèn đường', NULL, ' Trung Quốc, Ấn Độ, Indonesia, Lào, Malaysia, Myanmar, Papua New Guinea, Thái Lan, Timor-Leste và Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'Gbif.org'),
(4441, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Miniopterus', NULL, 'GEN_1234', 'miniopteruspusillus', 'Miniopterus pusillus', '(Dobson, 1876)', 'Dơi cánh ngắn', 'SPA_04480', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4442, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Miniopterus', NULL, 'GEN_1234', 'miniopterusschreibersii', 'Miniopterus schreibersii', '(Kuhl, 1817)', 'Dơi cánh dài', 'SPA_04481', ' Là loài dơi có kích thước trung bình mảnh khảnh với trán hình vòm đặc trưng. Nó có mõm ngắn, tai hình tam giác tách biệt rộng rãi và lông lưng màu nâu xám đến xám đen.   Loài này dường như ưa thích môi trường sống giàu rừng gỗ cứng và chủ yếu đậu thành đàn trong các hang động đá vôi, hầm mỏ và hầm chứa các loài sống trong hang động khác. Bay nhanh và cơ động với màng đuôi rộng cho phép săn bướm đêm, bọ cánh cứng, ấu trùng Lepidoptera và thậm chí cả nhện', NULL, ' ', NULL, NULL, NULL, NULL, 'NT', NULL, 'Eurobats'),
(4443, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Murina', NULL, 'GEN_1260', 'murinaauratus', 'Murina auratus', 'Milne -Edwards,1872', 'Dơi mũi ống nhỏ', 'SPA_04482', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4444, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Murina', NULL, 'GEN_1260', 'murinacyclotis', 'Murina cyclotis', 'Dobson, 1872            ', 'Dơi mũi ống tai tròn', 'SPA_04483', 'Dơi mũi ống tai tròn có trọng lượng từ 9 đến 12 g, với tổng chiều dài từ 80 đến 89 mm. Chỉ có một số đo sải cánh (229 mm) được báo cáo cho loài này. Con cái có xu hướng lớn hơn một chút so với con đực. Dơi mũi ống tai tròn được chẩn đoán là có lỗ mũi hình ống và tai ngắn, tròn. Chúng có hình tam giác, dài, hẹp và thuôn nhọn về một điểm. Vỏ não phía trước phồng lên và môi trên có một tua lông nhô ra. có đôi mắt nhỏ gần tai hơn lỗ mũi. Hai mẫu màu khác nhau đã được ghi nhận. Trong một biến thể màu, lông lưng có màu nâu đỏ, với các sợi lông nhạt dần từ gốc đến ngọn; lông bụng có màu trắng xám, pha chút nâu. Ở biến thể màu khác, lông lưng có màu xám hơn, không có tông màu đỏ; lông bụng có màu trắng xám không có chút ánh nâu. Loài này có màng cánh bán trong suốt, ngón tay cái tương đối dài và đuôi ngắn hơn chiều dài đầu và thân. Bàn chân có lông, nhỏ, móng vuốt tương đối dài và sắc.  Sống ở độ cao thấp tới 250 m ở chân đồi đến 1.500 m ở các khu rừng trên núi. Dơi mũi ống tai tròn được tìm thấy chủ yếu ở các khu rừng nhiệt đới ở Đông Nam Á. Dơi mũi ống tai tròn phát hiện môi trường của chúng thông qua khả năng định vị bằng tiếng vang và tối thiểu thông qua trường thị giác, vì mắt của chúng nhỏ và nhỏ. Họ cũng nhạy cảm với các tín hiệu hóa học', NULL, ' i Lanka, Ấn Độ, Nepal, xa về phía bắc đến miền bắc Myanma, phía nam qua Đông Dương, Việt Nam, Malaysia và một phần của Indonesia và quần đảo Sunda nhỏ hơn. Chúng cũng được tìm thấy ở Quần đảo Philippine trên các đảo Biliran, Camiguin, Catanduanes, Luzon, Mindanao, Sibuyan và Siqujor', NULL, NULL, NULL, NULL, NULL, NULL, 'Animaldiversity'),
(4445, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Murina', NULL, 'GEN_1260', 'murinahuttoni', 'Murina huttoni', '(Perters, 1872)', 'Dơi mũi ống', 'SPA_04484', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4446, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Murina', NULL, 'GEN_1260', 'murinaleucogaster', 'Murina leucogaster', '(Milne-Edwards, 1872)', 'Dơi mũi ống lớn', 'SPA_04485', 'Lông lưng màu nâu đỏ đến xám nâu, có lông trắng rải rác. Lông bụng nhạt màu. Đuôi có lông. Như với tất cả Murina , lỗ mũi tạo thành những ống ngắn.\n\n· Tai tương đối hẹp và ngắn.\n\n· Chiều dài cẳng tay 37,9 mm, 41,1 mm (nam trưởng thành); (phạm vi 40-43 mm, ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'bio.bris.'),
(4447, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Murina', NULL, 'GEN_1260', 'murinasp', 'Murina sp.', NULL, NULL, 'SPA_04486', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4448, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Murina', NULL, 'GEN_1260', 'murinatubinaris', 'Murina tubinaris', '(Scully, 1881)', 'Dơi mũi ống lông chân', 'SPA_04487', 'Đầu thân 45,7 mm, đuôi 35-6 mm, tai 14 mm, chân sau 9-4 mm (mẫu điển hình), cẳng tay 31-35-6 mm. Bộ lông lưng có màu nâu xám nhạt (lông có gốc màu nâu trung bình và dải màu xám nhạt dần dần chuyển sang màu nâu nhạt trước khi đến đầu màu nâu sẫm hơn); bụng có màu trắng (lông có gốc màu nâu trung bình và phần ngọn có màu trắng nhạt).  Khuôn mặt có ít lông ngoại trừ lỗ mũi trần dài nhô ra. Tai ngắn, rộng và tròn, mép trước lồi nhẵn, mép sau có khía nhỏ và đầu tai tròn rộng.  Hộp sọ nhỏ, có hộp sọ tương đối phẳng và phần mõm không phồng lên; mào dọc không có, và mào dạng lam tương đối yếu ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Gbif'),
(4449, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Myotis', NULL, 'GEN_1276', 'myotisannamiticus', 'Myotis annamiticus', 'Kruskop et Tsytsulina, 2001', 'Dơi tai việt nam', 'SPA_04488', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4450, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Myotis', NULL, 'GEN_1276', 'myotisannectans', 'Myotis annectans', '(Dobson, 1871)', 'Dơi mặt lông', 'SPA_04489', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4451, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Myotis', NULL, 'GEN_1276', 'myotisater', 'Myotis ater', '(Peter, 1866)', 'Dơi muỗi Mô-lu-ca', 'SPA_04490', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4452, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Myotis', NULL, 'GEN_1276', 'myotischinensis', 'Myotis chinensis', '(Tomes, 1857)', 'Dơi tai lá rộng', 'SPA_04491', 'Lông lưng màu xám nâu. Lông bụng có màu xám hoặc xám trắng, có đôi cánh tương đối rộng. Đây là một loài tương đối lớn. Tai khá dài và bàn chân nhỏ hơn đáng kể. Loài này có quan hệ gần gũi với loài dơi tai chuột lớn M. myotis và M. blythii vùng Cổ Bắc Cực.  ', NULL, ' Cũng được ghi nhận từ Myanmar, Việt Nam và Thái Lan ', NULL, NULL, NULL, NULL, 'LR', NULL, 'University of Bristol'),
(4453, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Myotis', NULL, 'GEN_1276', 'myotisdaubentonii', 'Myotis daubentonii', '(Kuhl, 1819)', 'Dơi muỗi chân lớn', 'SPA_04492', 'sải cánh 240 - 275 mm. Bộ lông của nó ngắn, rậm và có màu nâu đỏ, có đường phân chia rõ ràng dọc theo cổ. Do chế độ ăn uống, nó có bàn chân to và khỏe, được bao phủ bởi những sợi lông cứng. Nó có thể được tìm thấy trong rừng rụng lá và rừng hỗn hợp, luôn gần các vùng nước. Vào mùa hè, nó đậu trong các hốc cây, hang động, tòa nhà và các công trình nhân tạo khác; vào mùa đông, loài này chủ yếu ưa thích các địa điểm dưới lòng đất: hầm mỏ, hang động, kẽ đá. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Eurobats'),
(4454, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Myotis', NULL, 'GEN_1276', 'myotisformosus', 'Myotis formosus', '(Hodgson, 1835)', 'Dơi tai đốm vàng', 'SPA_04493', 'chiều dài cẳng tay 45-50 mm. Các mảng màu đỏ đặc trưng trên màng cánh. Màu lông sáng.  Đậu trong tán lá. Ngủ đông trong hang động. Được tìm thấy từ mực nước biển đến chân đồi Himalaya ', NULL, ' ở khu vực Ấn Độ-Mã Lai, từ Afghanistan ở phía Tây đến Philippines và các đảo của Indonesia ở phía đông. Được tìm thấy ở phía nam và phía đông Trung Quốc', NULL, NULL, NULL, NULL, NULL, NULL, 'Bris'),
(4455, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Myotis', NULL, 'GEN_1276', 'myotishorsfieldii', 'Myotis horsefieldi', '(Temminck, 1840)', 'Dơi tai hoos fin', 'SPA_04494', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4456, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Myotis', NULL, 'GEN_1276', 'myotislaniger', 'Myotis laniger', '(Peters, 1870)', 'Dơi tai', 'SPA_04495', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4457, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Myotis', NULL, 'GEN_1276', 'myotismuricola', 'Myotis muricila', '(Gray, 1846)', 'Dơi tai chân nhỏ', 'SPA_04496', 'Lông lưng màu nâu sẫm, có rễ sẫm màu và đầu nhạt màu hơn. Bụng có thể nhẹ hơn.Bàn chân nhỏ có màng cánh dính ở gốc các ngón chân. Răng cối nhỏ hàm trên ở giữa nhỏ và thường hơi nhô ra khỏi chân răng. Răng nanh hàm trên dài hơn nhiều so với răng hàm trên phía sau. Kích thước nhỏ với chiều dài cẳng tay 31-37 mm Kiếm ăn vào đầu buổi tối. có thể bay cao và tương đối nhanh', NULL, ' bao gồm hầu hết Đông Nam Á, Đông Ấn Độ, Indonesia và Philippines. Được tìm thấy ở Đài Loan và miền trung nam Trung Quốc', NULL, NULL, NULL, NULL, NULL, NULL, 'bris.ac'),
(4458, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Myotis', NULL, 'GEN_1276', 'myotismystacinus', 'Myotis mystacinus', '(Kyhl, 1819)', 'Dơi tai có ria', 'SPA_04497', 'Dơi có râu có kích thước nhỏ (sải cánh từ 190 - 225 mm), có bộ lông xoăn, sẫm màu và hành vi rất sống động.  Nó phân bố ở nhiều môi trường sống (thành thị, miền núi và nông nghiệp, cũng như rừng) và vào mùa hè, M. mystacinus đậu trong các kẽ hở trong đá, tòa nhà và hốc cây. Để ngủ đông, loài này thích các địa điểm dưới lòng đất.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Eurobats'),
(4459, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Myotis', NULL, 'GEN_1276', 'myotisrosseti', 'Myotis rosseti', '(Oey, 1951)            ', 'Dơi rô xét', 'SPA_04498', 'Đầu thân 36 - 47 mm, đuôi 32 - 42 mm, tai 11 - 14 mm, chân sau 5 - 1 - 7 - 5 mm, cẳng tay 27 - 5 - 31 mm; trọng lượng 3 - 8 - 6 g. Myotis ngón cái dày có miếng đệm dày màu hồng ở ngón cái và miếng đệm hình tam giác nhỏ ở bàn chân. Bộ lông tương đối ngắn, màu xám nhạt đến nâu xám đậm ở phần trên, với các sợi lông có gốc màu nâu sẫm và đầu màu nhạt. Phần dưới nhẹ hơn. Tai có màu xám, dài và hình phễu, có đường viền đặc biệt ở rìa ngoài. Mõm và các chi có màu hơi hồng và không có sắc tố đặc biệt. Màng cánh có màu xám đen  Sườn núi có rừng dày đặc, thung lũng hẹp và sông rải đầy đá cuội (miền bắc Việt Nam), cảnh quan bán trống với số lượng lớn tre cao (miền nam Việt Nam), môi trường sống bị xáo trộn và các khu đô thị có độ cao lên tới > 500 m. Ở Thái Lan, nó đậu trong hốc cây, mái nhà và tre. Sống thành bầy. Con cái mang thai vào tháng 11. Những con cái bị bắt ở Việt Nam vào tháng 11 có bằng chứng rõ ràng về việc cho con bú, cho thấy sinh con vào cuối mùa hè hoặc đầu mùa thu và do đó sinh sản đa tính.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Gbif'),
(4460, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Myotis', NULL, 'GEN_1276', 'myotissiligorensis', 'Myotis siligorensis', '(Horsefield, 1855)', 'Dơi tai sọ cao', 'SPA_04499', 'Lông mặt lưng đồng màu nâu sẫm. Lông mặt bụng có phần ngọn màu nâu nhạt và phần gốc lông màu nâu sẫm. Màng cánh và màng gian đùi đồng màu nâu. Loa tai dài, có mấu tai hẹp, nhọn và cao khoảng 1/2 chiều cao của loa tai. Ngọn đuôi tự do ngoài màng gian đùi. Dơi tai sọ cao thường trú ngụ trong các hang động, đường hầm, khe đá hoặc dưới tán cây; thường bay đi kiếm ăn khi trời mới bắt đầu tối và trở về nơi ở khoảng 30 phút trước khi mặt trời mọc. Loài dơi này thường bay kiếm ăn ở độ cao khoảng 2-5m so với mặt đất; có tập tính trao lượn khoảng 10 - 15 phút ở cạnh nơi trú ngụ trước khi bay đi nơi khác. Thời kỳ động dục và mang thai (đối với con cái) từ tháng 6 đến tháng 8 hàng năm.', NULL, 'Trong nước: Lai Châu, Lào Cai, Lạng Sơn, Ninh Bình, Nghệ An, Hà Tĩnh và Kontum. Thế giới: Ấn Độ, Trung Quốc, Thái Lan, Malaixia, Indonesia (Borneo).', NULL, 'là đặc hữu của Việt Nam', 'Loài dơi hiếm của Việt Nam và có giá trị khoa học', 'LR', NULL, NULL, 'VnCreature'),
(4461, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Myotis', NULL, 'GEN_1276', 'myotissp', 'Myotis sp.', NULL, 'Dơi muỗi ', 'SPA_04500', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4462, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Pipistrellus', NULL, 'GEN_1562', 'pipistrellusabramus', 'Pipistrellus abramus', '(Temminck, 1838)', 'Dơi muỗi đầu vàng', 'SPA_04501', 'Có kích thước bé. Màu lông xám, lưng sẫm màu hơn so với bụng. Kích thước dương vật và baculum của con đực rất dài và cong. Trọng lượng 4g (3,4-6,6),\nchiều dài cẳng tay (FA): 29,8 mm (27,8-32,8); Chiều dài thân (HB): 44 mm (36,5-49); chiều dài\nđuôi (Tail): 37 mm (30-40); chiều dài tai (Ear): 12,1 mm (9,3-12,5) Chúng cũng thường tập trung thành đàn nhỏ, cư trú trong những hốc hoặc khe nứt nhỏ tại những ngôi nhà hoặc công trình nhân tạo. Thường hoạt động ở những nơi gần nguồn nước (ao, hồ,…) và đèn đường - những nơi có nhiều côn trùng hoạt động vào ban đêm. Hoạt động kiếm ăn của chúng từ\nlúc nhập nhoạng tối đến tận bình minh, song thời gian kiếm ăn chính vào mùa hè tập trung vào\nlúc hoàng hôn (18h00 - 19h30) và lúc bình minh (4h30 - 5h30). ', NULL, 'Việt Nam, loài dơi này đã được ghi nhận ở Cao Bằng, Bắc Kạn, Thái Nguyên, Tam Đảo (Vĩnh Phúc), Hà Nội, Cúc Phương (Ninh Bình), Cát Bà (Hải Phòng), Ngọc Lặc (Thanh Hóa), Vũ Quang (Hà Tĩnh), Thừa Thiên-Huế có vùng phân bố rộng, từ vùng Viễn Đông (Siberia) của Nga, sang các nước Đông Á, xuống Nam Trung Quốc, Bắc Đông Dương và miền Bắc Ấn Độ.', NULL, NULL, NULL, NULL, NULL, NULL, 'HỘI NGHỊ KHOA HỌC TOÀN QUỐC VỀ SINH THÁI VÀ TÀI NGUYÊN SINH VẬT LẦN THỨ 6'),
(4463, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Pipistrellus', NULL, 'GEN_1562', 'pipistrelluscardonea', 'Pipistrellus cardonea', 'Schreber, 1774', 'Dơi mũi Ca đô', 'SPA_04503', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4464, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Pipistrellus', NULL, 'GEN_1562', 'pipistrellusceylonicus', 'Pipistrellus ceylonicus', '(Kelaart, 1852)', 'Dơi màng cánh nâu', 'SPA_04504', 'Đầu thân 45 - 64 mm, đuôi 30 - 45 mm, tai 9 - 14 mm, chân sau 6 - 11 mm, cẳng tay 33 - 42 mm; trọng lượng 7 - 10g. Mặt lưng thay đổi từ nâu xám đến nâu vàng hoặc từ hạt dẻ đến nâu đen, có ánh cam; bụng có màu nâu trung bình nhạt hơn và chỉ nhạt hơn lưng một chút. Tai, mặt và màng có màu nâu sẫm đồng nhất. Tai to và nhọn thẳng Sự giao phối xảy ra trong hai tuần đầu tiên của tháng 6, quá trình rụng trứng và thụ tinh diễn ra vào tuần thứ hai của tháng Bảy. Sự thụ tinh muộn kéo dài c. 2 - 5 tuần trong các nghiên cứu nuôi nhốt và dường như kéo dài c. 1 tháng ở cá thể hoang dã.  Quá trình mang thai kéo dài 50 - 55 ngày và số con trong lứa là 1 - 3 con (hầu như luôn luôn là hai con).  Môi trường sống khác nhau bao gồm các vùng khô cằn và rừng núi ẩm ướt từ mực nước biển đến độ cao  2150m.  Đậu một mình hoặc theo bầy lên tới 200 cá thể. Sống về đêm, rời chuồng sớm vào buổi tối để kiếm ăn. Nó kiếm ăn chủ yếu là bọ cánh cứng, bướm đêm, ruồi (Diptera) và các côn trùng khác.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Gbif'),
(4465, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Pipistrellus', NULL, 'GEN_1562', 'pipistrelluscoromandra', 'Pipistrellus coromandra', '(Gray, 1838)            ', 'Dơi muỗi nâu', 'SPA_04505', 'Màu lông  thường có màu nâu đồng nhất trên lưng và dao động từ màu hạt dẻ sẫm đến màu nâu đinh hương sẫm. Các khu vực có rừng cũng như ở các thị trấn và thành phố. Được tìm thấy trong các tòa nhà và cây cối', NULL, ' Ấn Độ, Afghanistan, Trung Quốc, Pakistan, Sri Lanka, Thái Lan, Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'indiabiodiversity'),
(4466, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Pipistrellus', NULL, 'GEN_1562', 'pipistrellusjavanicus', 'Pipistrellus javanicus', '(Gray, 1838)            ', 'Dơi mũi Ja va', 'SPA_04506', 'Chiều dài cơ thể là 40,3mm, chiều dài đuôi là 32,7mm và chiều dài cẳng tay là 33,2mm. Thân hình nhỏ nhắn. Tai ngắn và rộng. Có một phần lồi phía trên gốc của mép ngoài và cuối hơi hình tam giác; hình thang ngắn, mép trong lõm, mép ngoài lồi và chiều cao bằng nửa chiều dài tai. Lông trên cơ thể ngắn và sẫm màu, lông lưng màu nâu khói hoặc nâu sẫm, lông bụng màu nâu xám nhạt hơn một chút. Phần gốc màu nâu sẫm và phần cuối màu nâu vàng nhạt; màng cánh màu nâu sẫm và kết thúc ở rìa bên của gốc ngón chân; khoảng cách từ màng chi hẹp; phần đuôi hơi nhô ra ngoài màng liên sườn. khoảng 0,5mm', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4467, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Pipistrellus', NULL, 'GEN_1562', 'pipistrellusmimus', 'Pipistrellus mimus', 'Wroughton, 1899.', 'Dơi', 'SPA_04507', 'Loại dơi này là loài dơi nhỏ nhất được ghi nhận ở Ấn Độ (tính đến thời điểm hiện tại). Mẫu vật trưởng thành nặng từ 2, đến 2,5 gam. Màu của lông là màu đen. Ban ngày, chúng ẩn mình trong các kẽ hở trong khung cửa, cột, dầm gỗ, dưới lớp ngói lợp mái nhà, chuồng gia súc và trong các hốc cây dừa.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'http://batsofkerala.com/research/pipistrellus-mimus-mimus/'),
(4468, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Pipistrellus', NULL, 'GEN_1562', 'pipistrelluspaterculus', 'Pipistrellus paterculus', '(Thomas, 1915)', 'Dơi mũi Pô pa', 'SPA_04508', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4469, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Pipistrellus', NULL, 'GEN_1562', 'pipistrelluspulveratus', 'Pipistrellus pulveratus', '(Peters, 1871). ', 'Dơi răng cửa lớn', 'SPA_04509', 'Đây là loài có kích thước trung bình với chiều dài cẳng tay 32,0–35,2 mm dựa trên 9 mẫu vật từ Myanmar. Bộ lông lưng dài, dày và mượt với những sợi lông màu nâu sẫm, gần như đen ở lưng và có chóp màu nâu vàng. Ở bụng, chân tóc rất sẫm màu với phần ngọn màu nâu nhạt nhạt hơn. Xương bàn tay thứ năm có chiều dài tương đương với xương bàn tay thứ ba và thứ tư. Trực giác có chiều dài 2,6–3,1 mm, có trục thẳng, rỗng bên dưới và đế đơn giản, không có hai thùy; đầu nhọn thẳng. Trong hộp sọ, các xương gò má rất khỏe mạnh với một đường lưng nhỏ trên mỗi xương hàm. Vùng cơ bản chẩm có một gờ trung tâm rõ ràng chạy giữa hai ốc tai nhưng các hố cơ bản chẩm hầu như không có. Răng cửa thứ hai  đạt đến độ cao của múi thứ cấp của răng cửa thứ nhất  và có diện tích thân răng gần bằng nhau. Răng nanh hàm trên  không có múi phụ. Diện tích thân răng của răng cối nhỏ hàm trên thứ nhất  thay đổi trong khoảng khoảng 2/3. Răng hàm dưới thứ nhất  có diện tích bằng 2/3 diện tích thân răng và từ một nửa đến 2/3 chiều cao của răng hàm thứ hai .  Tất cả các mẫu chứng từ được thu thập trong các lưới phun sương đặt trong các hang đá vôi lớn, mỗi hang có một loạt các buồng lớn phức tạp. Thảm thực vật trên các mỏm đá vôi bao gồm cây leo, dương xỉ và một số ít cây còi cọc. Các khu rừng mưa thường xanh và bán thường xanh ở vùng đất thấp ban đầu phần lớn đã bị chặt phá, chỉ còn sót lại những tàn tích rải rác, bị xáo trộn nhiều.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'TreatmentBank'),
(4470, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Pipistrellus', NULL, 'GEN_1562', 'pipistrellusschreibersi', 'Pipistrellus schreibersi', 'Schreber, 1774', 'Dơi cánh dài', 'SPA_04510', 'Dơi cỡ trung bình, có chiều dài khoảng 48 đến 65 mm (đầu và thân), sải cánh từ 35 đến 35 mm, chiều dài cẳng tay từ 43 đến 48 mm, đuôi từ 46 đến 64 mm và trọng lượng từ 9 mm và 16g. Lông lưng có vẻ ngoài như len và có màu xám, trong khi phần bụng nhạt màu hơn. Đầu tròn với một loại cằm có lông. Loài dơi này có mõm nhỏ, tai nhỏ tách biệt và hình tam giác (dài 12 đến 13,5 mm), không nhô ra phía trên đầu và có một vành tai nhỏ.', NULL, NULL, NULL, NULL, NULL, NULL, 'VU', NULL, 'https://vi.wikipedia.org/wiki/Pipistrellus_pipistrellus'),
(4471, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Pipistrellus', NULL, 'GEN_1562', 'pipistrellustenuis', 'Pipistrellus tenuis', '(Temminck, 1840)            ', 'Dơi mũi nhỏ', 'SPA_04511', 'Lông lưng có màu nâu sẫm. Lông bụng nhạt màu hơn: phần ngọn lông được đánh bóng với phần gốc màu nâu đậm hơn. Chiều dài cẳng tay 25-31 mm. Vành tai hơi cong ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'bris.ac'),
(4472, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Scotomanes', NULL, 'GEN_1799', 'scotomanesornatus', 'Scotomanes ornatus', '(Blyth, 1851)', 'Dơi đốm hoa', 'SPA_04512', 'Loài dơi có kích thước trung bình và rất dễ nhận dạng bởi màu sắc sặc sỡ. Mặt lưng màu vàng cam sáng hoặc màu vàng nâu, lông tại gốc màu sẫm hơn. Rải rác trên đầu lưng, sườn là những đốm l8ng màu trắng, đôi khi tạo thành một dải trắng xuống dưới lưng. Lông mặt bụng là hỗn hợp giữa các lông màu trắng và tối, thường có một vòng xung quanh cổ. Mấu tai ngắn và phần đỉnh hơi cong về phía trước. Kích thước: HB (chiều dài thân đầu): 62,2 - 67mm; T (chiều dài đuôi): 50,1 - 52mm; E (chiều dài tai): 18,8 - 20,8mm; HF (chiều dài bàn chân sau, cả móng): 12.3 -12.8mm; FA (chiều dài cẳng tay):54,6 - 56mm; Wt (trọng lượng): 23,9 - 29gr. Loài dơi này thường bay dọc theo các con suối và sát mặt nước để kiếm ăn. Thức ăn là các loài côn trùng nhỏ. Chúng thường ghép đôi vào tháng 12 đến tah1ng 1 hàng năm, thời gian mang thai tháng 3 đến tháng 5 và sinh con  vào tháng 5 đến tháng 6. Con non mới đẻ có  HB (chiều dài thân đầu): 36,4mm; T (chiều dài đuôi): 18,4mm; HF (chiều dài bàn chân sau, cả móng): 9mm; E (chiều dài tai): 9,8mm; FA (chiều dài cẳng tay): 15,5mm; Wt (trọng lượng): 6gr. Sống dưới tán cây rừng nguyên sinh và thứ sinh trên độ cao 150 - 700m. Đã gặp ở độ cao đến 950m và chúng thường trú trong các hốc bọng cây cách mặt đất từ 2 - 4m.', NULL, 'Hửu Liên (Lạng Sơn), Tam Đảo (Vĩnh Phúc), Cúc Phương (Ninh Bình), Vụ Quang (Hà Tĩnh), Phong Nha - Kẻ Bàng (Quảng Bình và Gia Lai, Bình Định. ', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4473, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Scotophilus', NULL, 'GEN_1800', 'scotophilusheathii', 'Scotophilus heathii', '(Horsfield, 1831)            ', 'Dơi nghệ lớn', 'SPA_04513', 'Chiều dài đầu và thân của dơi vàng châu Á lớn hơn là 8–9 cm (3,1–3,5 in), cẳng tay dài 6–7 cm (2,4–2,8 in) và sải cánh là 40 cm (16 in). Dơi nặng 48–52 g (1,7–1,8 oz). Con trưởng thành có màu nâu vàng đồng ở phía trên và màu vàng sáng đến hơi đỏ ở phía dưới. Màng cánh có màu nâu đen. Lông ngắn và dày đặc ngoại trừ trên cổ. Mõm cùn, trần trụi và tối màu. Vành tai có hình lưỡi liềm và được ngăn cách với mép sau của loa tai bằng một rãnh dễ thấy. Đuôi dài. Con non có màu nâu xám sẫm. ', NULL, ' Nó được tìm thấy ở Afghanistan , Bangladesh , Campuchia , Trung Quốc , Ấn Độ , Indonesia , Lào , Myanmar , Nepal , Pakistan , Philippines , Sri Lanka , Thái Lan và Việt Nam ', NULL, NULL, NULL, NULL, 'LC', NULL, 'wikipedia.org'),
(4474, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Scotophilus', NULL, 'GEN_1800', 'scotophiluskuhlii', 'Scotophilus kuhlii', 'Leach, 1821', 'Dơi nghệ nhỏ', 'SPA_04514', 'Lông lưng màu nâu không có màu vàng của S. heathii . Lông bụng nhẹ hơn lông lưng. Chiều dài cẳng tay là 44-55 mm nên có thể phân biệt được với S. heathii về kích thước (loại sau là 55-66 mm). Cả hai loài đều có vành hình lưỡi liềm.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'bio.bris.'),
(4475, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Scotophilus', NULL, 'GEN_1800', 'scotophilusornata', 'Scotophilus ornata', '(Blyth, 1851)', 'Dơi đốm hoa', 'SPA_04515', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4476, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Scotophilus', NULL, 'GEN_1800', 'scotophilussp', 'Scotophilus sp.', NULL, 'Dơi', 'SPA_04516', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4477, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Thainycleris', NULL, 'GEN_1948', 'thainyclerisaureocollaris', 'Thainycleris aureocollaris', '(A. Smith, 1829)', 'Dơi muỗi cổ vàng', 'SPA_04517', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4478, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Tylonycteris', NULL, 'GEN_2004', 'tylonycterisaureocollaris', 'Tylonycteris aureocollaris', 'Kock&Storch, 1996', 'Dơi muỗi cổ vàng', 'SPA_04518', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4479, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Tylonycteris', NULL, 'GEN_2004', 'tylonycterisfulvida', 'Tylonycteris fulvida', '(Blyth, 1859)', 'Dơi tre', 'SPA_04519', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4480, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Tylonycteris', NULL, 'GEN_2004', 'tylonycterispachypus', 'Tylonycteris pachypus', '(Temminck, 1840)            ', 'Dơi chân đệm thịt', 'SPA_04520', 'Dài cẳng tay 24 - 28mm, dài đuôi 27- 29mm, dài tay 8 - 9mm, trọng lượng 3,5 - 5mm (4 dơi mẫu ở Borneo và nhiều dơi mẫu ở bán đảo Mã Lai). hộp sọ: dài 0,4 - 10,6mm, dài hàng răng hàm trên 3,1 - 3,5mm. Phần thân trên màu nâu sang nâu đỏ nhạt, phần thân dưới nhạt màu hơn và có sắc cam nhẹ. Lông khá ngắn và mượt. Thân và hộp sọ khá dẹp với lớp đệm rộng có hình da trên ngón cái và bàn chân.  Sống thành từng nhóm nhỏ trong các lóng tre, len vào qua các kẽ hở nhỏ do loài bọ cánh cứng tạo ra. Thường chọn các cây tre tươi nhỏ, trong khi dơi Tylonycteris robustula thường thích những cuống lá khô lớn hơn, mặc dù vậy cả hai loài này thỉnh thoảng có thể dùng chung một nơi trú ngụ vào các thời điểm khác nhau.', NULL, 'Việt Nam loài này được tìm thấy ở các tỉnh Lai Châu (Mường Mô), Lao Cai (Bảo Hà), Kontum (Đắc Lây). Từ Ấn Độ sang phía Nam Trung Quốc, Đông nam Á, Philipin, Sumatra, Java và các đảo nhỏ hơn ', NULL, NULL, 'Loài hiếm, có giá trị nghiên cứu khoa học và tiêu diệt các loài côn trùng gây hại trong thiên nhiên.', NULL, NULL, NULL, 'VnCreature'),
(4481, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'CHIROPTERA', 'DƠI', 'ORD_018', 'Vespertilionidae', 'Dơi Muỗi', 'FAM_391', 'Tylonycteris', NULL, 'GEN_2004', 'tylonycterisrobustula', 'Tylonycteris robustula', 'Thomas, 1915            ', 'Dơi Rô but', 'SPA_04521', 'Lông lưng và bụng màu nâu, họng và bụng nhạt hơn lưng. Chiều dài cẳng tay 25,0 -29,0 mm, trung bình 27,2 mm. Sải cánh trung bình là 195,5 mm. Hộp sọ cực kỳ phẳng, có các miếng đệm ở khớp ngón chân và khớp khuỷu, tất cả những đặc điểm này là sự thích nghi với việc trú ngụ trên thân tre. Trọng lượng trung bình 4,8g.  Rừng cây và rừng tre là môi trường sống điển hình. Xuất hiện hai lần mỗi đêm vào lúc bình minh và hoàng hôn, thường kiếm ăn khoảng hai mươi phút mỗi lần.', NULL, ' Ấn Độ tới Myanmar, Thái Lan, Malaysia, Indonesia và Philippines', NULL, NULL, NULL, NULL, NULL, NULL, 'bris.ac'),
(4482, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'DERMOPTORA', 'CÁNH DA', 'ORD_032', 'Cynocephalidae', 'Chồn Dơi', 'FAM_113', 'Cynocephalus', NULL, 'GEN_0531', 'cynocephalusvariegatus', 'Cynocephalus variegatus', '(Audebert,1799)', 'Chồn dơi, Cầy bay', 'SPA_04522', 'Đầu rộng, tai ngắn tròn hoặc tù. Mắt to, màu nâu đỏ hay nâu lục nhạt. Màng da nối từ cổ với chi trước, chi sau tới hết các ngón chân và bao phủ tới đầu mút đuôi. Lông trên lưng và mặt mang da màu xám tro với nhiều lốm đốm màu trắng nhạt. Lông bụng và mặt dưới màng da hung đỏ hoặc nhạt hơn, không có đốm. Con cái có màu xám, con đực màu sáng hơn chuyển dần sang màu nâu, thậm chí hơi đỏ. Chiều dài chi trước và chi sau gần bằng nhau, có 5 ngón. Các ngón chân nối nhau bằng màng da tới tận gốc vuốt chân. Đuôi dài chỉ bằng khoảng 1/3 dài thân. Chồn dơi sống đơn lẻ trong các khu rừng nguyên sinh hay thứ sinh có nhiều cây gỗ to trên núi cao và vùng đất thấp. Chồn dơi hoàn toàn sống trên cây. Chúng bò  trên cây giỏi nhưng chậm, có thể bay liệng từ cây này sang cây khác với khoảng cách khá xa. Hoạt động vào ban đêm. Thức ăn là quả cây rừng, trứng chim và chim non. Chồn dơi nuôi trong chuồng bằng các loại quả mềm và rau xanh như: chuối, đu đủ, cam, soài, rau diếp... Làm tổ trong bọng cây to cao 20 - 50 m. Mùa sinh sản từ tháng 6 đến tháng 9. Mang thai khoảng 8 tuần. Đẻ mỗi lứa 1 con. Con sơ sinh yếu được nuôi trong túi do màng da ở phần đuôi tạo thành. Túi da mềm và ấm, con non sống trong túi đến khi tự lập. Con non chưa cai sữa, mẹ đã chửa lứa tiếp theo.', NULL, 'Lai Châu, Thanh Hoá, Nghệ An, Hà Tĩnh, Quảng Bình, Thừa Thiên - Huế, Kontum, Gia Lai, Đắk Lắk, Đồng Nai, Bình Phước, Tây Ninh.  Ấn Độ, Thái Lan, Malaixia, Indonesia, Lào, Cambodia.', NULL, NULL, 'Loài thú quý, hiếm, đã được đưa vào Sách đỏ thế giới.', 'EU', NULL, NULL, 'vncreatures.net'),
(4483, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'DERMOPTORA', 'CÁNH DA', 'ORD_032', 'Cynocephalidae', 'Chồn Dơi', 'FAM_113', 'Galeopterus', NULL, 'GEN_0727', 'galeopterusvariegatus', 'Galeopterus variegatus', '(Audebert, 1799)', 'Chồn dơi', 'SPA_04523', 'Đầu rộng, tai ngắn tròn hoặc tù. Mắt to, màu nâu đỏ hay nâu lục nhạt. Màng da nối từ cổ với chi trước, chi sau tới hết các ngón chân và bao phủ tới đầu mút đuôi. Lông trên lưng và mặt mang da màu xám tro với nhiều lốm đốm màu trắng nhạt. Lông bụng và mặt dưới màng da hung đỏ hoặc nhạt hơn, không có đốm. Con cái có màu xám, con đực màu sáng hơn chuyển dần sang màu nâu, thậm chí hơi đỏ. Chiều dài chi trước và chi sau gần bằng nhau, có 5 ngón. Các ngón chân nối nhau bằng màng da tới tận gốc vuốt chân. Đuôi dài chỉ bằng khoảng 1/3 dài thân.', NULL, 'Trong nước: Lai Châu, Thanh Hoá, Nghệ An, Hà Tĩnh, Quảng Bình, Thừa Thiên - Huế, Kontum, Gia Lai, Đắk Lắk, Đồng Nai, Bình Phước, Tây Ninh.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=7&loai=1&ID=5231'),
(4484, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ERINACEOMMORPHA', 'ĂN SÂU BỌ', 'ORD_034', 'Erinaceidae', 'Chuột Voi', 'FAM_137', 'Hylomys', NULL, 'GEN_0926', 'hylomyssinensis', 'Hylomys sinensis', 'Trouessart, 1909', 'Chuột voi đồi', 'SPA_04524', 'Đuôi dài, chiếm 50 - 60% (trung bình 54%) chiều dài thân đầu. Xương ngọc hành thon dài, nhọn, có một cặp gai. Phần sau xoang mũi kéo dài đến ranh giới giữa hai ổ mắt. Răng nanh hàm trên lớn hơn một chút so với răng cửa số 3 và răng trước hàm liền kề. Ở hàm dưới, răng cửa đầu tiên mở rộng, răng cửa thứ hai nhỏ hơn nhiều so với răng cửa đầu tiên và thứ ba; răng nhanh gần bằng hoặc lớn hơn một chút so với răng cửa thứ ba. Có 3 răng hàm trên và 3 răng hàm dưới. Công thức răng: 3/3, 1/1, 3/3, 3/3 x 2 = 40.\nChúng cũng sống ở độ cao lớn hơn Hylomys suillus, nơi chúng có thể di chuyển hoặc đào hang ở bờ suối hay dưới những khúc gỗ.', NULL, 'Trong nước: Sơn La, Hoà Bình, Lai Châu, Lào Cai (Vườn quốc gia Hoàng Liên).\nNước ngoài: Trung Quốc, Myanmar', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=6263'),
(4485, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ERINACEOMMORPHA', 'ĂN SÂU BỌ', 'ORD_034', 'Erinaceidae', 'Chuột Voi', 'FAM_137', 'Hylomys', NULL, 'GEN_0926', 'hylomyssuillus', 'Hylomys suillus', 'Müller, 1840', 'Chuột voi đồi', 'SPA_04525', 'Đây là loài chuột lớn, con trưởng thành dài khoảng 1 cm đến 15 cm, thức ăn của chúng là sâu bọ và các động vật nhỏ', NULL, 'Loài chuột voi này được phát hiện ở Đông Nam Á', NULL, NULL, NULL, NULL, 'IC', NULL, 'https://vi.m.wikipedia.org/wiki/Chu%E1%BB%99t_voi_%C4%91%E1%BB%93i'),
(4486, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ERINACEOMMORPHA', 'ĂN SÂU BỌ', 'ORD_034', 'Talpidae', 'Chuột Chũi', 'FAM_363', 'Euroscaptor', NULL, 'GEN_0696', 'euroscaptorklossi', 'Euroscaptor klossi', '(Thomas, 1929)            ', 'Chuột chũi k-lốt', 'SPA_04526', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4487, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ERINACEOMMORPHA', 'ĂN SÂU BỌ', 'ORD_034', 'Talpidae', 'Chuột Chũi', 'FAM_363', 'Euroscaptor', NULL, 'GEN_0696', 'euroscaptormicrura', 'Euroscaptor micrura', '(Hodgson, 1841)', 'Chuột cù lìa ', 'SPA_04527', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4488, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ERINACEOMMORPHA', 'ĂN SÂU BỌ', 'ORD_034', 'Talpidae', 'Chuột Chũi', 'FAM_363', 'Euroscaptor', NULL, 'GEN_0696', 'euroscaptorparvidens', 'Euroscaptor parvidens', '(Milner, 1940)', 'Chuột chũi răng nhỏ ', 'SPA_04528', 'Đầu — thân 135 - 150 mm, đuôi 5 - 5 - 10 - 5 mm, chân sau 13 - 5 - 16 mm; trọng lượng 37 - 3 - 71 - 7 g. Đuôi của chuột chũi răng nhỏ có kích thước 4:1 - 7 - 1 % chiều dài đầu-thân. Thân dài, đuôi ngắn; hầu hết các đốt sống đuôi gần đều nằm dưới hông lớn. Lông có màu nâu. Răng hàm trên nhỏ một cách dễ thấy. ', NULL, 'Chuột chũi răng nhỏ xuất hiện ở hai vùng phân bố biệt lập ở Tây Nguyên và miền Nam Việt Nam và ít được biết đến.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4489, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ERINACEOMMORPHA', 'ĂN SÂU BỌ', 'ORD_034', 'Talpidae', 'Chuột Chũi', 'FAM_363', 'Euroscaptor', NULL, 'GEN_0696', 'euroscaptorsubanura', 'Euroscaptor subanura', 'Kawada et al, 2012', 'Chuột cù lìa không đuôi', 'SPA_04529', 'Kích thước nhỏ, cơ thể dài, hông rộng. Lông mặt lưng có màu nâu sẫm; bụng màu nâu bạc, có thể có đám lông màu cam đậm đưới chi trước do ảnh hưởng của dịch tiết. Đuôi rất ngắn, chiếm 2 – 4,2% chiều dài thân đầu, khó có thể nhìn thấy từ bên ngoài, tất cả các đốt sống đuôi đều nằm phía trong xương chậu. Mõm thon dài, có dạng hình thang với nhiều ria dài mọc sang hai bên. Cạnh trước của sụn lỗ tai ngoài hướng về phía trước. Không giống như các loài cùng giống ở Việt Nam, E. subanura có răng trước hàm số 4 ở hàm trên (P4) có các đỉnh trước nhỏ hơn đỉnh protocone. Ở hàm trên, các đỉnh protocone nhọn; răng hàm dưới không có đỉnh hypoconulids. Sườn rộng, các xương gần nhau; xương chậu, đặc biệt là đốt xương háng ngắn. Đốt sống đuôi: 8 – 9. Công thức răng: 3/3, 1/1, 4/4, 3/3 x 2 = 44. Sinh sống ở khu vực đồi núi thấp. Đào hầm, sống hoàn toàn dưới mặt đất (fossorial).', NULL, 'Tuyên Quang, Vĩnh Phúc, Hà Nội, Phú Thọ, Ninh Bình, Nghệ An, Quảng Bình. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4490, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ERINACEOMMORPHA', 'ĂN SÂU BỌ', 'ORD_034', 'Talpidae', 'Chuột Chũi', 'FAM_363', 'Paracaptor', NULL, 'GEN_1442', 'paracaptorleucura', 'Paracaptor leucura', '(Blyth, 1850)', 'Chuột chũi đuôi trắng ', 'SPA_04530', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4491, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ERINACEOMMORPHA', 'ĂN SÂU BỌ', 'ORD_034', 'Talpidae', 'Chuột Chũi', 'FAM_363', 'Parascaptor', NULL, 'GEN_1463', 'parascaptorleucura', 'Parascaptor leucura', '(Blyth, 1850)            ', 'Chuột chũi', 'SPA_04531', 'Loài chuột chũi khá nhỏ này có mõm ngắn và chiều dài của đuôi chỉ bằng 1/12 tổng chiều dài. Lông đuôi có màu trắng, dài và thô hơn phần thân còn lại. Màu sắc của bộ xương có màu nâu đồng đều. ', NULL, ' Ấn Độ, Myanmar, Bangladesh, Trung Quốc', NULL, NULL, NULL, NULL, NULL, NULL, 'indiabiodiversity'),
(4492, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'ERINACEOMMORPHA', 'ĂN SÂU BỌ', 'ORD_034', 'Talpidae', 'Chuột Chũi', 'FAM_363', 'Talpa', NULL, 'GEN_1908', 'talpamicrura', 'Talpa micrura', 'Hodgson, 1841.', 'Chuột cù lìa', 'SPA_04532', 'Một loài động vật thuộc họ chuột chũi. Cơ thể dài khoảng 5 đến 25 cm, chân trước và chân sau ngắn nhưng lòng bàn chân có hình xẻng và mỗi ngón có 5 ngón. mõm nhọn, thân màu nâu sẫm đến nâu đen, lông mềm như lụa. Chúng chủ yếu sống trong hang dưới lòng đất. Đây là loài đặc hữu của Hàn Quốc. Nguồn: Bách khoa toàn thư về hình thái động vật (Gyemongsa, 1993)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'http://animal.memozee.com/view.php?tid=5&did=875&mode=full'),
(4493, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'INSECTIVORA', 'ĂN CÔN TRÙNG', 'ORD_044', 'Soricidae', 'Chuột Chù', 'FAM_346', 'Anourosorex', NULL, 'GEN_0110', 'anourosorexsquamipes', 'Anourosorex squamipes', 'Milne-Edwards, 1872', 'Chuột chù cộc', 'SPA_04533', 'Anourosorex squamipes là một loài chuột chũi thuộc nhánh chuột chũi châu Á thuộc họ động vật có vú', NULL, 'Trung Quốc, Bhutan, Ấn Độ, Myanmar, Thái Lan và Việt Nam. Giống như tất cả các loài khác thuộc chi Anourosorex, chuột chũi Trung Quốc là loài ăn hóa thạch và được tìm thấy trong các khu rừng trên núi.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.thainationalparks.com/species/chinese-mole-shrew'),
(4494, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'INSECTIVORA', 'ĂN CÔN TRÙNG', 'ORD_044', 'Soricidae', 'Chuột Chù', 'FAM_346', 'Chimarrogale', NULL, 'GEN_0377', 'chimarrogalehimalayica', 'Chimarrogale himalayica', '(gray, 1842)            ', 'Chuột chù nước', 'SPA_04534', 'Chuột chù nước Himalaya là loài động vật có vú nhỏ, bán thủy sinh. Rất ít cá nhân đã bị bắt. Một số ít có chiều dài từ đầu đến thân là 111 - 132 mm, trung bình là 121 mm và chiều dài đuôi là 79 - 88 mm, trung bình là 85 mm. Đuôi thon nhưng có nhiều lông. Chuột chù nước Himalaya trưởng thành có trọng lượng từ 37 – 56 g. Không có sự dị hình giới tính về ngoại hình hoặc kích thước. Bộ xương phẳng và dày đặc, có màu nâu xám không có ranh giới màu giữa lưng và bụng. Các đặc điểm hộp sọ và khuôn mặt bao gồm: mõm tương đối phẳng, vành tai nhỏ và râu dài màu nâu, thể tích khoang não lớn so với các loài chuột chù khác. Chiều dài lớn nhất của hộp sọ là từ 25 – 28 mm, có 3 răng cửa trên (răng cửa trên không có chỏm). ( Francis, 28 ; Li và Boren, 1999 ; Lunde và Musser, 22 ; Sterndale, 1884 )', NULL, 'Chuột chù nước Himalaya ( Chimarrogale himalayica ) có vùng phân bố rộng nhưng lẻ tẻ trên khắp dãy Himalaya, bao gồm: Bắc Ấn Độ, Nepal, Lào, Myanmar, Việt Nam, miền nam Trung Quốc và Đài Loan', NULL, NULL, NULL, NULL, NULL, NULL, 'https://animaldiversity.org/accounts/Chimarrogale_himalayica/'),
(4495, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'INSECTIVORA', 'ĂN CÔN TRÙNG', 'ORD_044', 'Soricidae', 'Chuột Chù', 'FAM_346', 'Crocidura', NULL, 'GEN_0487', 'crociduraattenuata', 'Crocidura attenuata', '(Milne -Edwards, 1872)', 'Chuột chù đuôi đen', 'SPA_04535', 'chiều dài đầu và thân từ 66 đến 89 mm (2,6 và 3,5 in) và đuôi thường dài từ 60% đến 70% chiều dài này. Trọng lượng của nó nằm trong khoảng từ 6 đến 12 g (0,2 đến 0,4 oz). Lông đầu và lưng có màu xám đen đến nâu khói và có màu đậm hơn vào mùa hè so với mùa đông. Phần dưới có màu xám đen và đuôi màu nâu sẫm ở trên và màu nâu giữa ở dưới.', NULL, 'Campuchia, đông nam Trung Quốc, miền bắc Ấn Độ, Cộng hòa Dân chủ Nhân dân Lào, Malaysia, Myanmar, Philippines, Đài Loan, Thái Lan và Việt Nam, và có thể cả Indonesia. Phạm vi độ cao của nó là từ mực nước biển lên tới khoảng 3.000 m', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4496, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'INSECTIVORA', 'ĂN CÔN TRÙNG', 'ORD_044', 'Soricidae', 'Chuột Chù', 'FAM_346', 'Crocidura', NULL, 'GEN_0487', 'crociduradracula', 'Crocidura dracula', 'Thomas, 1921.', 'Chuột chù đuôi trắng', 'SPA_04536', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4497, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'INSECTIVORA', 'ĂN CÔN TRÙNG', 'ORD_044', 'Soricidae', 'Chuột Chù', 'FAM_346', 'Crocidura', NULL, 'GEN_0487', 'crocidurafuliginosa', 'Crocidura fuliginosa', '(Blyth, 1855)            ', 'Chuột chù màu gỉ sắt', 'SPA_04537', 'Chuột chù Đông Nam Á (tên khoa học Crocidura fuliginosa) là một loài động vật có vú trong họ Chuột chù, bộ Soricomorpha. Loài này được Blyth mô tả năm 1855', NULL, 'Loài được tìm thấy ở Campuchia, Lào, Malaysia, Myanma, Thái Lan, Trung Quốc, Việt Nam và có thể có ở Ấn Độ.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://indiabiodiversity.org/observation/show/18193931'),
(4498, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'INSECTIVORA', 'ĂN CÔN TRÙNG', 'ORD_044', 'Soricidae', 'Chuột Chù', 'FAM_346', 'Crocidura', NULL, 'GEN_0487', 'crocidurahorsfieldi', 'Crocidura horsfieldi', '(Tomes, 1856)', 'Chuột chù nâu xám', 'SPA_04538', 'Chuột chù Horsfield, tên khoa học Crocidura horsfieldii, là một loài động vật có vú trong họ Chuột chù, bộ Soricomorpha. Loài này được Tomes mô tả năm 1856', NULL, 'Chúng được tìm thấy ở Ấn Độ, Campuchia, Đài Loan,Lào, Nepal, Nhật Bản, Sri Lanka, Thái Lan, Trung Quốc và Việt Nam.', NULL, NULL, NULL, NULL, 'IC', NULL, 'https://vi.wikipedia.org/wiki/Chu%E1%BB%99t_ch%C3%B9_Horsfield'),
(4499, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'INSECTIVORA', 'ĂN CÔN TRÙNG', 'ORD_044', 'Soricidae', 'Chuột Chù', 'FAM_346', 'Crocidura', NULL, 'GEN_0487', 'crociduraindochinensis', 'Crocidura indochinensis', 'Robinson et Kloss, 1922', 'Chuột chù Đông Dương', 'SPA_04539', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4500, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'INSECTIVORA', 'ĂN CÔN TRÙNG', 'ORD_044', 'Soricidae', 'Chuột Chù', 'FAM_346', 'Crocidura', NULL, 'GEN_0487', 'crociduramarita', 'Crocidura marita', '(Thomas, 1904)', 'Chuột chù nhà ', 'SPA_04540', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4501, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'INSECTIVORA', 'ĂN CÔN TRÙNG', 'ORD_044', 'Soricidae', 'Chuột Chù', 'FAM_346', 'Crocidura', NULL, 'GEN_0487', 'crociduraphanluongi', 'Crocidura phanluongi', 'Jenkins, Abramov, Rozhnov, Olsson, 2010', 'Chuột chù phan luong', 'SPA_04541', 'Lông ở mặt lưng có màu xám đen, phần bụng nhạt màu hơn phần lưng. Đuôi nhạt màu hơn màu cơ thể, mặt trên màu đậm hơn mặt dưới, đậm dần về phía chóp đuôi. Lông tơ cứng mọc đến 66,7 - 75% chiều dài đuôi. Đầu thuôn nhỏ, mũi và các chi nhạt màu hơn màu thân. Mặt trên của bàn chân sáng màu. Xương mỏ và vùng cung gò má hẹp, nhưng vùng xương hàm trên lại rộng; khoảng cách giữa hai hốc mắt hẹp hơn so với độ rộng xương hàm trên và hộp sọ. Răng hàm trên số 3 mảnh, răng hàm dưới số 3 có núm sau đơn giản, gần như chỉ còn một đỉnh. Đỉnh sau của I1 cao bằng 1/3 răng I1, đỉnh parastype P4 thấp hơn U3.', NULL, 'Trong nước: Đắk Lắk, Đồng Nai, Bà Rịa – Vũng Tàu', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=6288'),
(4502, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'INSECTIVORA', 'ĂN CÔN TRÙNG', 'ORD_044', 'Soricidae', 'Chuột Chù', 'FAM_346', 'Crocidura', NULL, 'GEN_0487', 'crocidurasp', 'Crocidura sp.', NULL, 'Chuột chù', 'SPA_04542', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4503, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'INSECTIVORA', 'ĂN CÔN TRÙNG', 'ORD_044', 'Soricidae', 'Chuột Chù', 'FAM_346', 'Suncus', NULL, 'GEN_1881', 'suncusetruscus', 'Suncus etruscus', 'Savi, 1822', 'Chuột chù Etruscan', 'SPA_04543', 'Đây là loài động vật có vú có trọng lượng nhỏ nhất, cân nặng trung bình chỉ 1,8 gram.[3][4][5][6][7] (loài dơi craseonycteris thonglongyai được coi là động vật có vú nhỏ nhất theo kích thước hộp sọ và chiều dài cơ thể', NULL, 'nó đã được tìm thấy ở Albania, Bosnia và Herzegovina, Bulgaria, Croatia, Cyprus, Pháp, Bắc Macedonia, Malta, Montenegro, Hy Lạp, Ý, Bồ Đào Nha, Slovenia, Tây Ban Nha và Thổ Nhĩ Kỳ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Suncus_etruscus'),
(4504, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'INSECTIVORA', 'ĂN CÔN TRÙNG', 'ORD_044', 'Soricidae', 'Chuột Chù', 'FAM_346', 'Suncus', NULL, 'GEN_1881', 'suncusmurinus', 'Suncus murinus', '(Linnaeus. 1766)            ', 'Chuột chù nhà', 'SPA_04544', 'Kích thước lớn - là loài Chuột chù lớn nhất ở Việt Nam, tuy nhiên kích thước có sự biến đổi giữa các vùng địa lý khác nhau. Tuỳ từng vùng, có sự khác biệt ít nhiều về kích thước giữa con đực và con cái. Đuôi mập, sáng màu hơn thân, chiều dài đuôi ngắn hơn chiều dài thân đầu, có lông dài bao phủ toàn bộ đuôi. Màu sắc lông có sự sai khác giữa các cá thể tuỳ theo môi trường sống, có thể từ xám nhạt cho đến nâu sẫm. Chuột chù nhà là loài sống hội sinh, ăn tạp. Chúng phân bố cả ở những nơi có con người, khu vực canh tác nông nghiệp, ít khi phát hiện trong rừng tự nhiên. Tập tính con non cắn đuôi nhau theo con mẹ đi kiếm ăn của các loài Chuột chù được thể hiện rõ nhất ở loài này. Hoạt động tìm kiếm thức ăn vào ban đêm, thường phát ra tiếng kêu nhỏ khi kiếm mồi. Ban ngày sống trong các hang hốc ẩm ướt. Thức ăn là các loài côn trùng, giun sống trong khu vực và các loài thức ăn thải loại của con người.', NULL, ' Khắp các tỉnh từ Bắc vào Nam. Châu Phi (từ Ai Cập tới Tanzania), Madagasca, Irac, Baranh, Ôman, Yemen, Arab, Apganistan, Pakistan, Ấn Độ, Xrilanca, Nepal, Mianma, Trung Quốc, Lào, Cambodia, Nhật Bản.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(4505, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'LAGOMORPHA', 'THỎ', 'ORD_047', 'Leporidae', 'Thỏ', 'FAM_215', 'Lepus', NULL, 'GEN_1065', 'lepusnigricollis', 'Lepus nigricollis', '(G. Cuvier, 1823 )', 'Thỏ nâu', 'SPA_04545', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4506, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'LAGOMORPHA', 'THỎ', 'ORD_047', 'Leporidae', 'Thỏ', 'FAM_215', 'Lepus', NULL, 'GEN_1065', 'lepuspeguensis', 'Lepus peguensis', 'Blyth, 1855            ', 'Thỏ nâu', 'SPA_04546', 'Đặc điểm nhận dạng:\nThỏ rừng nặng khoảng 2 - 4 kg, dài thân 380 - 500mm, dài đuôi 65 - 80mm. Bộ lông mềm, mịn, Đầu, mặt trên cổ, lưng, hông, mông trên màu mốc hoặc vàng xám. Bụng trắng đục. Tai hơi nâu, Đuôi ngắn, lông đuôi phớt trắng.\nSinh học, sinh thái:\nThỏ rừng sống ở rừng thưa, savan cây bụi nơi có nhiều trảng cỏ, thích hợp nhất là vùng giáp ranh giữa rừng với bãi cỏ ven nương bãi. Sống thành đôi hay đàn nhỏ, kiếm ăn trên mặt đất. Ngủ trong bụi cây. Vận động đi lại nhanh nhẹ. Chạy nhanh nhưng chóng mất sức. Không biết leo trèo. Kiếm ăn từ chập tối đến nửa đêm. Khi ăn no chúng thường tập trung đùa rỡn trên bãi cỏ.Thỏ ăn nhiều lá chồi non của nhiều loài thực vật rừng (cây có nhựa mủ trắng, cây họ Cúc Asteraceae) và nhiều loài cây trồng (Đậu, Lạc, Rau muống...). Thỏ rừng đẻ từ mùa xuân đến mùa thu, mỗi năn 3 - 4 lứa. Mang thai 30 ngày, mỗi lứa 2 - 4 con. Con non sau 6 tháng thì trưởng thành sinh dục.', NULL, 'Việt Nam: Loài có vùng phân bố hầu khắp ở các tỉnh từ Quảng Bình đến Tây Ninh Đồng Nai, Long An.\n\nThế giới: Nam Trung Quốc, Ấn Độ, Mã Lai, Thái Lan, Campuchia, Lào', NULL, NULL, 'Thỏ rừng cho da lông và thực phẩm (Một con thỏ có thể cho 0,2 - 0,3m2 da lông, 0,8 - 1 kg thịt).', NULL, NULL, NULL, NULL),
(4507, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'LAGOMORPHA', 'THỎ', 'ORD_047', 'Leporidae', 'Thỏ', 'FAM_215', 'Nesolagus', NULL, 'GEN_1312', 'nesolagustimminsi', 'Nesolagus timinsi ', 'Averianov, Abramov et Tikhonov, 2000', 'Thỏ vằn', 'SPA_04547', 'Có hình dạng giống thỏ rừng. Điểm khác biệt nổi bật nhất là có các sọc màu đỏ chạy dọc trên lưng và trên đầu có các vạch lông mầu đen. Loài mới phát hiện vào năm 1998 nên chưa có nghiên cứu sâu về sinh học, sinh thái. Loài này thường dống ở các khu rừng thường xanh còn tốt từ Nghệ An, Hà Tĩnh trở vào đến Quảng Bình', NULL, 'Trong nước: Năm 1998, phát hiện được ở khu bảo tồn thiên nhiên Phong Nha - Kẻ Bàng (Quảng Bình) và Pù Mát (Nghệ An) và có thể có ở Hương Sơn (Hà Tĩnh). Thế giới: Được phát hiện ở Lào vào năm 1998.', NULL, NULL, 'Loài hiếm và chưa có nhiều nghiên cứu chuyên sâu về tập tính, sinh thái, có giá trị khoa học. Đây là loài mới phát hiện ở Việt Nam và Lào', 'EN', NULL, NULL, 'VnCreature'),
(4508, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PHOLIDOTA', 'TÊ TÊ', 'ORD_065', 'Manidae', 'Tê Tê', 'FAM_228', 'Manis', NULL, 'GEN_1158', 'manisjavanica', 'Manis javanica', '(Desmarest, 1822)', 'Trút', 'SPA_04548', 'Thân cỡ trung bình. Dài 0,4 – 0,65m, trọng lượng 6 - 8kg. Không có răng, lưỡi dài nhiều chất dính. Toàn thân, từ đầu đến cuối đuôi phủ lớp vẩy sừng. Các vẩy sừng xếp chồng lên nhau như mái ngói. Bụng không có vẩy sừng, da dầy có lớp lông cứng. Mầu sắc của vẩy thường là mầu nâu sẫm, vàng hoặc vàng nhạt, có những con bạch tạng do nuôi con trong hang lâu ngày. Có 17 hàng vẩy thân xếp theo chiều dọc, 11 - 13 hàng xếp theo chiều ngang; đuôi có 25 hàng vẩy xếp theo chiều dọc, 8 hàng xếp theo chiều ngang (3 hàng mặt trên, 3 hàng mặt dưới và 2 hàng mép đuôi. Các móng (vuốt) chân trước dài hơn móng chân sau, móng giữa phát triển mạnh. Thức ăn chủ yếu là mối, kiến, côn trùng nhỏ ở mặt đất, đôi khi có cả cỏ, lá cây mục. Động dục, ghép đôi vào tháng 10, đẻ con vào tháng 3 ở trong hang. Mỗi lứa 1 - 2 con (rất ít trường hợp đẻ 3 con). Con non thường có lớp vẩy mầu trắng đục. Chúng sống trong rừng già, rừng thứ sinh, rừng hỗn giao tre nứa gỗ, ở hang dưới các gốc cây to, cây mục nát, hoặc vách đất đá trong lùm cây rậm rạp. Hoạt động kiếm ăn ban đêm trên mặt đất, ban ngày trú ẩn trong hang.', NULL, 'Trong nước: Hà Tĩnh, Quảng Bình, Quảng Trị, Thừa Thiên - Huế, Quảng Nam, Đà Nẵng, Kontum, Gia Lai, Tây Ninh. Thê giới: Mianma, Lào, Cămpuchia, Thái Lan, Malaixia, Indonesia.', NULL, NULL, 'Loài quý hiếm. Có khả năng tiêu diệt mối, kiến và nhiều loài côn trùng hại gỗ và cây rừng. Là loài thú nuôi cảnh đẹp trong công viên và vườn thú.', 'EN', NULL, NULL, 'VnCreature'),
(4509, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PHOLIDOTA', 'TÊ TÊ', 'ORD_065', 'Manidae', 'Tê Tê', 'FAM_228', 'Manis', NULL, 'GEN_1158', 'manispentadactyla', 'Manis pentadactyla', 'Linnaeus. 1758            ', 'Tê tê', 'SPA_04549', 'Cỡ nhỏ hơn Tê tê giava. Thân dài 0,2 tới 0,5m. Trọng lượng: 5 - 7kg. Không có răng, lưỡi dài nhiều chất dính. Toàn thân (trừ bụng) phủ lớp vẩy sừng, vẩy sừng xếp chồng lên nhau giống như lợp ngói. Có 15 hàng vẩy thân xếp theo chiều dọc, 11 - 13 hàng xếp theo chiều ngang; đuôi có 14 - 17 hàng vẩy xếp theo chiều dọc, 8 hàng xếp theo chiều ngang (3 hàng ở mặt trên, 3 hàng ở mặt dưới, 2 hàng ở mép đuôi). Vẩy có mầu vàng sẫm, vàng, hoặc vàng nhạt. Có những con bạch tạng do nuôi con trong hang lâu ngày. Bụng không có vẩy, da bụng dầy có lông thưa cứng. Bàn chân trước 5 ngón, 3 ngón giữa có móng (vuốt) dài và cong. Móng chân trước dài gấp 1,5 lần móng chân sau Thức ăn là mối, kiến, ong đất, ấu trùng (nhộng) côn trùng lẫn cả cỏ, lá cây mục. Mùa sinh sản từ tháng 1 - 3. Thời gian có chửa 5 tháng. Mỗi lứa đẻ 1 - 2 con. Sống trong rừng ẩm nhiệt đới, rừng già, rừng thứ sinh, rừng hỗn giao tre nứa gỗ, ưa thích là rừng trên đồi núi thấp có nhiều cỏ cây mục nát. Hoạt động kiếm ăn ban đêm, ban ngày ẩn nấp trong hang. Hang sâu 2 - 4m, rộng 20 - 30cm, đoạn cửa hang hướng theo chiều sườn dốc, đoạn sau bằng xiên vào lòng đất. Khi gặp nguy hiểm, cuộn tròn như quả bóng.', NULL, 'Trong nước: Lai Châu, Sơn La, Tuyên Quang, Bắc Kạn, Lạng Sơn, Bắc Giang, Vĩnh Phú, Thái Nguyên, Hoà Bình, Hà Tây, Nghệ An, Quảng Trị, Gia Lai, Đắk Lắk, Lâm Đồng Thế giới: Nêpan, Ấn Độ (Assam, Sikkim), Mianma, nam Trung Quốc (Hải Nam, Đài Loan), Thái Lan, Inđônêxia.', NULL, NULL, 'Là loài thú hiếm. Có giá trị nghiên cứu khoa học và nuôi làm cảnh trong các vườn thú, công viên.', 'EN', NULL, NULL, 'VnCreature'),
(4510, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Cercopithecidae', 'Khỉ', 'FAM_068', 'Macaca', NULL, 'GEN_1132', 'macacaarctoides', 'Macaca arctoides', '(I Geoffroy, 1831)           ', 'Khỉ mặt đỏ', 'SPA_04550', 'Màu lông thường là màu nâu sẫm, nhưng cũng có biến đổi từ đen sang đỏ. Phần dưới của bụng bao giờ cũng nhạt hơn phía trên. Lưng màu nâu đỏ tới nâu sẫm. Mặt phần lớn có màu đỏ. Lông trên đỉnh đầu thường toả ra các phía xung quanh. Lông ở hai bên má toả ra phía sau. Khỉ mặt đỏ có đuôi to, ngắn, không quá 1/3 dài bàn chân sau. Dương vật của con đực trưởng thành dài khác thường. Điểm nổi bật là chai mông to, không có lông. Thời gian mang thai 178 ngày (Ross, 1992), khoảng cách giữa các kỳ sinh: 19 tháng. Thời gian sống khoảng 30 năm ( Ross, 1991). Thức ăn chủ yếu là quả, hạt, lá non, nõn và động vật kể cả côn trùng, chim và trứng (Richard, 1989). Chúng hoạt động vào ban ngày. Cuộc sống leo trèo và cả đi trên mặt đất. Khỉ mặt đỏ thường hay đi trên mặt đất trong rừng và dọc theo các bờ sông và suối (Richard, 1989), chưa thấy chúng bơi. Trong lúc đi ăn thường phát ra tiếng kêu để gọi nhau hoặc khi thấy nguy hiểm. Trong đàn có con đực dẫn đầu để bảo vệ đàn. Cấu trúc đàn là nhiều đực, nhiều cái, kích thước đàn từ 5-40 cá thể (Wolfheim, 1983). Trong một ngày đàn có thể di chuyển 400- 3000m (Betrand, 1969). Khỉ mặt đỏ thường sống trong các khu rừng thấp, gió mùa, rừng khô và các khu rừng rậm trên núi cao tới 2000m so với mực nước biển. Tuy vậy vẫn quan sát thấy chúng ở những khu dân cư, đền và miếu', NULL, 'Trong nước: Rộng khắp cả nước: Lai Châu (Tuần Giáo, Quỳ Nhai, Kim Sơn, Mường Tè), Lào Cai (Sapa, Sình Hồ), Sơn La (Mộc Châu, sông Mã), Hà Giang, Cao Bằng (Trùng Khánh), Tuyên Quang (Tát Kẻ, Chiêm Hoá, Bản Bung), Hoà Bình (Đà Bắc, Mai Châu, Kim Bôi), Thanh Hoá (Như Xuân, Hồi Xuân), Nghệ An (Bến Thuỷ), Hà Tĩnh (Hương Khê, Hương Sơn), Quảng Bình (Tuyên Hoá, Minh Hoá, Bố Trạch), Thừa Thiên - Huế (Bạch Mã, Hải Vân, Huế), Quảng Trị (Dakrong, Lao Bảo), Gia Lai (Kon Hà Nừng, Kon Cha Răng), Kontum (Mom Ray), Đắk Lắk (Krông Nô, Đăc Min, Ea Sup, Mdrak), Lâm Đồng (Đà Lạt). Thế giới: Nam và Đông nam Á', NULL, NULL, 'Là đối tượng nghiên cứu khoa học. Mặt khác nếu bảo vệ và tổ chức nhân nuôi tốt chúng sẽ trở thành nguồn gen thử nghiệm vaccine phục vụ con người.', 'VU', 'VU', NULL, 'VnCreature'),
(4511, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Cercopithecidae', 'Khỉ', 'FAM_068', 'Macaca', NULL, 'GEN_1132', 'macacaassamensis', 'Macaca assamensis', 'McClelland, 1839            ', 'Khỉ mốc', 'SPA_04551', 'Một số đặc điểm để phân biệt các loại sinh vật khác là: Kích thước cơ lớn hơn, lông dày và dài hơn. Đuôi dài hơn cốt vàng. Lông sau lông có lông (trụi ở khối vàng). Màu lông có thể đổi từ màu nâu đậm sang màu nâu vàng nhạt, nhưng ở vai, gáy, đỉnh đầu và tai thường sáng hơn và vàng hơn phía sau chân và đuôi. Lông xung quanh mặt màu đen, hai má có lông màu xám, phía trong và phía dưới của đùi màu trắng xám. Lông đuôi dài phần dưới đuôi có màu nhạt hơn phần trên. Hướng lông ở đỉnh đầu rất đặc biệt, mọc ra sang phải và sang trái, xoắn ở gốc tai. Mào hướng về phía sau. Có túi má, chai mơ lớn, xung quanh có lông. Đuôi thường mập gốc, ngắn gần nửa chiều dài thân nhưng dài hơn 10% chiều dài thân và dài hơn bàn chân sau, đuôi không thon, Chăm sóc sinh sản xung quanh năm. Mỗi lượt cung cấp một con. Thường gặp khối lượng vào tháng 4, 5, 7, 8, 10. Trọng lượng sơ sinh từ 300-500g. Thức ăn chủ yếu là quả, lá non, côn trùng, thằn lằn và một số động vật nhỏ. Tăng cường hoạt động vào ban ngày. Cuộc sống leo leo và có nhiều lúc đi trên mặt đất. Chúng ta thường ngủ trên cây và trên núi đá. Cấu hình đàn: Nhiều đực, nhiều cái. Số lượng cá thể trong đàn thường lớn nhất từ ​​10 - 50 con (Wolfheim, 1983). Sống trong rừng cây cao trên núi đá, núi đất, sống phần lớn ở rừng ẩm thường xanh, rừng thưa, rừng tre nứa, cánh đồng gần rừng. Trú ẩn trong các hang trầm dưới mỏ đá, hoặc thư mình trong các loại nước hoa. Sống theo đàn làm một con đực làm chỉ huy canh gác khi đàn kiếm ăn. Có thể sống chung với , culi, vượn, thiết kế đỏ, thiết kế vàng hoặc voọc đen, voọc mũi hếch, voọc ngũ sắc (Fooden, 1982). Võng phân bố ở độ cao từ 150 - 1200m, có khi tới 1750m.', NULL, 'Trong nước: Từ Lào Cai đến Quảng Bình. Thế giới: Nam và Đông nam Á cho đến Butan, Trung Quốc.', NULL, NULL, 'Là đối tượng nghiên cứu khoa học. Mặt khác, nếu bảo vệ tốt, chúng tôi sẽ trở thành nguồn động vật dùng để nghiên cứu, thử nghiệm Vắc-xin phục vụ cuộc sống con người..', 'VU', 'VU', NULL, 'VnCreature'),
(4512, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Cercopithecidae', 'Khỉ', 'FAM_068', 'Macaca', NULL, 'GEN_1132', 'macacafascicularis', 'Macaca fascicularis', '(Rafles,1821)', 'Khỉ đuôi dài', 'SPA_04552', 'Lông thường có màu từ xám đến nâu đỏ, phía sau cơ thể nhạt hơn. Lông trên đầu mọc hướng về sau. Thường có mào. Mặt có màu hồng. Con đực lớn thường có hai chỏm lông trắng trên miệng ở hai bên như bộ ria. Con cái có lông quanh mồm thưa hơn. Con non sinh ra có màu đen. Đuôi dài và được phủ lông tốt, chiều dài đuôi thường đạt 3/4 hoặc hơn so với chiều dài cơ thể. Tuổi trưởng thành vào lúc 50 - 51 tháng (Harvey, 1987). Thời gian mang thai 160 - 170 ngày (Nowak, 1991). Thời gian giữa hai lần sinh sản 13 tháng (12 - 24 tháng) (Ross, 1992). Thời gian sống 37 - 38 năm (Michael, 1993). Thức ăn chủ yếu là quả (64%), hạt, nõn cây, lá những phần khác của thực vật và động vật như côn trùng ếch nhái cua vv... (Payne, 1985). Chúng hoạt động vào ban ngày và trên cây. Loài này bơi rất giỏi và thường nhảy xuống nước từ cành cây. Con đực đầu đàn thường ít đánh dấu khu vực như các loài khỉ khác. Các con non thường đùa nghịch với nhau trong đàn. Chúng thường đùa với nhau trong vòng hai năm. Con đực thường đùa với con đực, con cái thường đùa với con cái. Rất hay ngồi thành nhóm ngay đường cái, không hoảng sợ khi xe chạy qua. Thường sống thành đàn, ít khi gặp một con. Đàn có cấu trúc nhiều đực, nhiều cái (Roonwal, 1977), trung bình 2,5 con cái 1 con đực. Chúng sống thành đàn từ 10-100 con (Wolfheim, 1983). Sống trong rừng rậm nguyên sinh, thứ sinh, rừng tre nứa, rừng thường xanh, rừng thưa, bờ sông, ven biển, rừng ngập mặn ven biển, dọc theo các con sông tới độ cao 2000m', NULL, 'Trong nước: Thừa Thiên - Huế trở vào tới Kiên Giang. Thế giới: Nam và Đông nam Á.', NULL, NULL, 'Làm vật mẫu, đối tượng nghiên cứu khoa học. Mặt khác nếu bảo vệ và nhân nuôi tốt chúng sẽ trở thành nguồn động vật thử nghiệm các loài Vaccine phục vụ đồi sống con người.', 'LR', NULL, NULL, 'VnCreature'),
(4513, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Cercopithecidae', 'Khỉ', 'FAM_068', 'Macaca', NULL, 'GEN_1132', 'macacaleonina', 'Macaca leonina', '(Blyth, 1863)            ', 'Khỉ đuôi lợn', 'SPA_04553', 'Là một trong những loài lớn nhất trong họ nhà Khỉ Cercopithecidae. Hai bên má lông dài, rậm, màu hung sáng phủ gần kín tai tạo thành đĩa mặt. ở đỉnh đầu lông màu hung xẫm hoặc xám đen tạo thành “xoáy” toả ra xung quanh gần giống cái mũ. Sau trán có một mảng lông hình tam giác màu nâu đậm. Thân phủ lông dài màu xám. Lông đuôi rất ngắn giống đuôi lợn. Má có túi, chai mông lớn. Đuôi thường mập phần gốc, kém nửa chiều dài thân nhưng dài hơn 10% chiều dài thân và dài hơn bàn chân sau. Tuổi thành thục sau 35 tháng (Caldecott, 1986). Thời gian mang thai 171 ngày. Thời gian sống 26,3 năm (Melnick, 1994); Thức ăn chủ yếu là quả và hạt: 73,8%, thức ăn động vật chiếm khoảng 12,2% (Whitten 1982), lá 5%, chồi non 4,1%. Hoạt động kiếm ăn ban ngày, cả ở thung lũng rừng thưa trên núi đất gần núi đá trên cây cũng như dưới mặt đất. Mùa đông trú ẩn trong các hang đá, mùa hè trú ẩn trong các hốc đá hay cành cây. Cấu trúc đàn gồm nhiều đực và nhiều cái. Sống thành đàn từ 10 - 12 con, có đàn tới 40 con hoặc nhiều hơn nữa. Nhiều lúc sống thành nhóm nhỏ 4 - 5 con. Sinh cảnh thích hợp là rừng nguyên sinh ở đai thấp hay rừng thứ sinh, rừng ngập nước, rừng khô rừng trên núi đá tới 1700m (', NULL, 'Trong nước: Lào Cai, Yên Bái, Sơn La, Hà Giang, Bắc Kạn, Thái Nguyên, Hoà Bình, Hà Tây, Nghệ An, Hà Tĩnh.Tuyên Quang (Na hang), Quảng Bình, (Bố Trạch, Minh Hoá),Thừa Thiên - Huế, (Bạch Mã), Gia Lai (Chư Xê, Kon Ka Kenh, Kon Cha Răng); Kontum, (Mom Ray, Sa Thầy), Đắk Lắk (Ea Sup, Yok Don), Lâm Đồng (Bảo Lộc), Tây Ninh, Đồng Nai, TP. Hồ Chí Minh Thế giới: Nam và Đông nam Á.', NULL, NULL, 'Làm mẫu vật phục vụ các đối tượng nghiên cứu khoa học. Mặt khác nếu bảo vệ tốt chúng sẽ trở thành nguồn gen để thử nghiệm các loài Vaccine phục vụ đời sống con người..', 'VU', NULL, NULL, 'VnCreature'),
(4514, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Cercopithecidae', 'Khỉ', 'FAM_068', 'Macaca', NULL, 'GEN_1132', 'macacamulatta', 'Macaca mulatta', '(Zimmermann, 1780)            ', 'Khỉ vàng', 'SPA_04554', 'Toàn thân màu Nâu vàng. Con trưởng thành có màu đỏ. Lông trên đỉnh đầu rất ngắn. Phía sau thân màu Nâu nhạt hơn phía trước ( Fa, 1985). Đuôi có độ dài trung bình ngắn hơn 3/4 chiều dài đầu và thân, được phủ một lớp lông tốt. Vùng ngoài và cơ đùi có màu đỏ. Da xung quanh chai tròn, không có lông. Vũ khí vàng sống trong điều kiện dao động rất lớn của môi trường nhiệt độ , lượng mưa cũng như độ cao. Từ vùng rất lạnh tới vùng nóng gần 50 0 C, từ nơi rất khô gần sa mạc tới nơi có lượng mưa hàng năm 10000 mm và từ độ cao so với mặt nước biển tới 3050m (Richie et. al, 1978). Southwick et.al (1961a; 1964) cho rằng sức sống thành nhóm tới 50 cá thể. Fooden (1971) đã quan sát được 20 cá thể trong một nhóm khỉ vàng ở Thái Lan năm 1967. Tuổi thành thục 42 - 48 tháng (Melnik, 1987). Thời gian mang thai 164 ngày. Khoảng cách giữa các lần sinh 12 - 24 tháng (Ross, 1992). Thời gian sống 29 năm (Ross, 1991). Thời gian sinh sản trong năm khoảng 3 - 6 tháng (Melnik, 1987). n chủ yếu là quả, hạt, lá, nõn cây, cỏ, một số Bộ: các bộ phận khác của cây và một số động vật không xương sống (Rochard, 1989). Gần 100 loài cây được sử dụng làm thức ăn (Lindburg, 1977). Là loại hoạt động ban ngày, phần lớn dưới đất, một phần trên cây (Seth, 1986). Cấu hình đàn nhiều con đực, nhiều cái. Trong đêm thường có cái sống tập thể. Con đực đầu đàn tuy có đầu nhưng thường ở phía bên ngoài nhóm (Parker, 1990). Số lượng cá thể trong đàn thường lớn tới 10 - 50 con có khi lên tới 90 con (Seth, 1986). Chúng tôi thích sống ở các vùng rừng nguyên sinh, thứ sinh, rừng khô, rừng ngựa giao, rừng tre nứa, rừng ngập nước, rừng thưa nhiệt đới, rừng thông, cây bụi, rừng ẩm nhiệt đới, gần khu nông nghiệp. Chúng ta sống ở độ cao 3000m (Parker, 1990). Nước là yếu tố ngăn chặn sự phân bố.', NULL, 'Trong nước: Phân bố từ biên giới phía Bắc tới các Tỉnh Tây Nguyên. Thế giới: Nam và Đông nam Á.', NULL, NULL, 'Được sử dụng trong sản xuất vắc xin chống bệnh đánh trẻ em, làm vật mẫu, đối tượng nghiên cứu khoa học. Hiện nay đã được Viện bảo vệ dịch sinh tại Hà Nội (Bộ Y tế) tổ chức nhân nuôi tại Đảo Rều (Quảng Ninh) với số lượng hàng bào tử để sản xuất vắc-xin. Cần có giải pháp bảo vệ tốt trong thiên nhiên để giữ nguồn gen quý giá.', 'LR', 'LC', NULL, 'VnCreature'),
(4515, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Cercopithecidae', 'Khỉ', 'FAM_068', 'Macaca', NULL, 'GEN_1132', 'macacanemestrina', 'Macaca nemestrina', '(Linnaeus, 1767)', 'Khỉ đuôi lợn', 'SPA_04555', 'Khỉ đuôi lợn lấy tên từ một đặc điểm hình thái độc đáo của chúng. Những chiếc đuôi ngắn của chúng, nửa dựng đứng, giống với đuôi lợn, do đó đặt cho chúng cái tên khỉ \"đuôi lợn\". Đuôi của chúng cũng có rất ít lông hoặc không có lông . Chiều dài đuôi ở con cái thay đổi từ 130 mm đến 253 mm và ở con đực, chiều dài đuôi thay đổi từ 160 mm đến 245 mm. Khỉ đuôi lợn có bộ lông màu nâu nhạt bao phủ cơ thể và bụng màu trắng. Tóc trên đỉnh đầu của chúng có màu nâu sẫm hoặc đen và mọc dài đến mức trông như có một vết lõm trên đỉnh đầu. Con đực có mái tóc giống bờm quanh mặt. Khỉ đuôi lợn cũng có chân dài và mõm không có lông . Khỉ đuôi lợn sơ sinh có màu đen khi sinh ra và phát triển màu sắc khi trưởng thành. Khỉ đuôi lợn là loài lưỡng hình giới tính, con đực lớn hơn. Con cái có kích thước gần bằng một nửa con đực. Chiều dài trung bình của con đực thay đổi từ 495 mm đến 564 mm. Cân nặng trung bình của con đực dao động từ 6,2 kg đến 14,5 kg. Chiều dài trung bình của con cái thay đổi từ 467 mm đến 564 mm. Trọng lượng trung bình của con cái dao động từ 4,7 kg đến 10,9 kg. Con đực cũng có răng nanh lớn dài trung bình 12 mm. Những chiếc răng này thường được sử dụng trong các cuộc chạm trán chủ nghĩa. Chiều dài trung bình của răng nanh cái là 7,3 mm Khỉ đuôi lợn sống ở độ cao bắt đầu từ mực nước biển và dao động đến trên 2000 m. Họ sống trong rừng, chủ yếu là rừng mưa nhiệt đới và đầm lầy. Chúng thích rừng nhiệt đới rậm rạp, ẩm ướt với nhiệt độ từ 18 đến 30 độ C (64 đến 86 độ F). Nhiệt độ thay đổi theo mùa và khác nhau theo vùng. Rừng nhiệt đới nơi chúng sinh sống cũng nhận được lượng mưa hơn 2500 mm  mỗi năm. Khỉ đuôi lợn không chung thủy một vợ một chồng và con cái sẽ giao phối với nhiều con đực trong suốt cuộc đời. Họ không phân biệt đối xử giữa thanh thiếu niên và nam giới trưởng thành. Khi chỉ có một số con cái đang động dục, những con đực có thứ hạng cao nhất sẽ có thể độc chiếm chúng. Chúng có thể ngăn cản những con đực trẻ hơn và cấp thấp hơn cố gắng giao phối và thường sẽ hành động hung hãn đối với con đực và con cái nếu con đực cấp thấp hơn cố gắng giao phối. Khỉ đuôi lợn là loài sinh sản quanh năm. Tuy nhiên, có sự gia tăng nhẹ trong tháng 1 và tháng 5. Con cái có chu kỳ sinh sản khoảng 30 đến 35 ngày và trong thời gian này có vết sưng tấy vùng sinh dục lớn màu hồng tím. Chúng sinh một con sau thời gian mang thai từ 162 đến 186 ngày. Khỉ đuôi lợn non sau đó được nuôi dưỡng từ 8 đến 12 tháng. Sau một năm, khỉ đuôi lợn được coi là thanh thiếu niên cho đến khi chúng trưởng thành về mặt sinh sản khi được 3 tuổi đối với con cái và 4,5 tuổi đối với con đực.', NULL, ' Chúng được tìm thấy ở nhiều quốc gia bao gồm Ấn Độ (đông bắc), Trung Quốc (phía nam), Indonesia (Borneo, Kalimantan, Sumatra), Bangladesh (đông), Miến Điện, Thái Lan, Lào, Campuchia, Việt Nam, Malaysia (Bán đảo Mã Lai). Cũng được tìm thấy ở Assam, Vân Nam, Đông Dương, Bangka và các đảo lân cận .', NULL, NULL, NULL, NULL, NULL, NULL, 'Animaldiversity'),
(4516, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Cercopithecidae', 'Khỉ', 'FAM_068', 'Pygathrix', NULL, 'GEN_1696', 'pygathrixnemaeus', 'Pygathrix nemaeus nemaeus', '(Linnaeus, 1771)', 'Voọc vá chân nâu', 'SPA_04556', 'Thân hình thon nhỏ. Bộ lông nhiều màu. Đỉnh đầu, trán màu đen. Lông mặt dầy tạo thành đĩa mặt, màu từ trắng xám đến xám. Cổ và ngực màu hung đỏ từ rực rỡ đến nhạt. Lưng màu xám nhạt hoặc lốm đốm trắng, lông ở vai màu xám đen. Chân, tay dài. Cánh tay từ khủyu đến mu bàn tay trắng xám. Đùi màu đen, ống chân hung đỏ đến nâu đỏ thẫm. Mu bàn chân và ngón màu đen. Đuôi rất dài. Sống trong rừng nguyên sinh trên núi cao, kiếm ăn cả ở rừng thứ sinh, rừng hỗn giao, nương rẫy. Thức ăn: Quả, lá cây rừng, ngô, khoai, sắn (trong nuôi nhốt), rau xanh. Sinh sản: Đẻ một con vào cuối mùa xuân đầu mùa hạ.', NULL, 'Trong nước: Thanh Hoá, Nghệ An, Hà Tĩnh, Quảng Bình, Thừa Thiên - Huế, Quảng Nam, Đà Nẵng, Kontum, Gia Lai, Đắk Lắk.  Lào', NULL, NULL, 'Có ý nghĩa khoa học rất lớn, số lượng ít, phân bố hẹp, loài đặc hữu của Việt Nam và Lào. Thịt làm thực phẩm, xương làm dược liệu, da lông xuất khẩu. ', 'EN', NULL, NULL, 'vncreatures'),
(4517, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Cercopithecidae', 'Khỉ', 'FAM_068', 'Pygathrix', NULL, 'GEN_1696', 'pygathrixnigripes', 'Pygathrix nigripes', '(Milne-Edwards, 1871)            ', 'Chà vá chân đen', 'SPA_04558', 'Thân hình thon nhỏ và hình dạng như Chà vá chân nâu Pygathrix nemaeus, chân, tay dài. Bộ lông dày, nhiều màu và mềm. Lưng màu xám - đen. Đầu trắng xám. Hai bên thái dương có viền lông nâu đỏ. Mặt nhiều lông dài màu trắng xám đến xám, dầy tạo thành đĩa mặt. Da quanh mắt màu vàng cam. Trán và quanh miệng màu xanh lam nhạt. Mũi xám nâu. Mắt nâu. Vai màu xám đen. Cẳng tay xám trắng, không có khúc trắng trên cẳng tay. Từ móng đến mu bàn chân đen. Cẳng chân xanh đen đến đen. Vùng bẹn và đuôi trắng đục. Đuôi nhỏ thon, dài hơn thân, màu trắng đục. Chà vá chân đen sống ở rừng kín thường xanh, rừng kín nửa rụng lá và rừng cây họ Dầu Dipterocarpaceae. Chúng sống đàn 10 đến 30 con, có con đực đầu đàn. Kiếm ăn vào buổi sáng và chiều, ngủ trên cây gỗ cao. Ăn lá non và mầm cây. Chưa biết nhiều về sinh sản của Chà vá chân đen.', NULL, 'Kontum, Gia Lai, Đắk Lắk, Lâm Đồng, Bình Dương, Bình Phước, Tây Ninh, Đồng Nai. Cămpuchia', NULL, NULL, 'Có ý nghĩa khoa học lớn, là loài đặc hữu của Việt Nam', 'EN', NULL, NULL, 'vncreatures'),
(4518, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Cercopithecidae', 'Khỉ', 'FAM_068', 'Trachypithecus', NULL, 'GEN_1972', 'trachypithecuscrepusculus', 'Trachypithecus crepusculus', '(Elliot, 1909)', 'Voọc xám', 'SPA_04559', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4519, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Cercopithecidae', 'Khỉ', 'FAM_068', 'Trachypithecus', NULL, 'GEN_1972', 'trachypithecuscristatus', 'Trachypithecus cristatus', 'Raffles, 1821            ', 'Voọc bạc', 'SPA_04560', 'có hình dáng tương tự như các loài colobines khác ở chỗ nó có kích thước nhỏ, đuôi dài và bộ lông rậm rạp. Khỉ lá bạc lấy tên từ màu sắc của bộ lông. Có một số biến thể về màu lông của chúng, bao gồm nâu, xám, xám nâu hoặc đen. Bàn tay và bàn chân có khả năng cầm nắm, không có lông và thường có màu đen. Con đực và con cái rất khó phân biệt với nhau. Sự khác biệt duy nhất có thể nhìn thấy được là mảng trắng không đều ở bên trong sườn của con cái. Con đực cũng lớn hơn con cái một chút: con cái chiếm 89% trọng lượng cơ thể của con đực. Con non có bộ lông màu cam và bàn tay, bàn chân và mặt màu trắng. Da thay đổi màu sắc trong vài ngày sau khi sinh thành màu đen, giống như ở con trưởng thành của loài này. Bộ lông màu cam chuyển sang màu trưởng thành trong vòng ba đến năm tháng. Chiều dài cơ thể ở con đực dao động từ 52,4 cm đến 56,0 cm, trong khi con cái thường là 46,5 cm đến 49,6 cm. Cả hai giới đều có đuôi dài hơn thân; chiều dài đuôi dao động từ 63 cm đến 84 cm. Trọng lượng cơ thể nam trung bình là 7,1 kg và trọng lượng cơ thể nữ là khoảng 6,2 kg. Trẻ sơ sinh cao khoảng 20 cm và nặng 0,4 kg khi mới sinh. Chúng đạt kích thước trưởng thành vào khoảng 5 tuổi. Không có mùa giao phối giới hạn, mặc dù có thời kỳ sinh sản cao điểm từ tháng 12 đến tháng 5 khi có nguồn thức ăn dồi dào. Thời gian mang thai từ 6 đến 7 tháng, chu kỳ động dục là 24 ngày. Con cái thường sinh không quá một con mỗi năm. Đã có trường hợp sinh đôi nhưng rất hiếm. Con cái đạt đến độ tuổi thành thục sinh dục khi được 4 tuổi, trong khi con đực trưởng thành từ 4 đến 5 tuổi. di chuyển chủ yếu bằng đường cánh tay, mặc dù các cá thể có thể đi trên mặt đất khi đi cùng nhóm. ăn chủ yếu là lá cây, ưa thích lá non. Là động vật ăn cỏ, chúng cũng ăn một số thực vật khác bao gồm trái cây, hạt, chồi, hoa và chồi. Khỉ lá bạc chủ yếu sống trong rừng rậm, nhưng môi trường sống của chúng có thể thay đổi đôi chút tùy theo khu vực.', NULL, ' được tìm thấy trên khắp Đông Nam Á và Indonesia, bao gồm Bán đảo Mã Lai, Borneo, Sumatra, Java, Thái Lan và Quần đảo Natuna.', NULL, NULL, NULL, NULL, NULL, NULL, 'animaldiversity'),
(4520, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Cercopithecidae', 'Khỉ', 'FAM_068', 'Trachypithecus', NULL, 'GEN_1972', 'trachypithecusdelacouri', 'Trachypithecus delacouri', '(Osgood, 1932)', 'Voọc mông trắng', 'SPA_04561', 'Bộ lông dày rậm, thô và màu đen. Đầu có mào lông hình chóp đen. Đám lông trắng trên má rộng, vượt lên trên vành tai. Lông vùng mông và đùi trắng. ở con cái, lông từ hông đến đùi có sự thay đổi màu, bình thường màu trắng và chuyển sang màu nâu nhạt rồi nâu thẫm trong thời kỳ mang thai và nuôi con non. Đuôi dài, lông dày, bông, sợi lông mọc vuông góc với đuôi và màu đen. Mặt trụi lông. Mắt nâu đen. Voọc non mới sinh có bộ lông màu vàng tơ và bắt đầu chuyển dần sang màu đen sau 4 tháng tuổi. Sau 10 tháng tuổi, toàn bộ cơ thể chuyển sang màu đen rõ, phần hông, đùi màu trắng, chỏm lông đỉnh đầu màu vàng nhạt. Sau 3 năm tuổi màu lông giống con trưởng thành Voọc mông trắng sống chủ yếu ở rừng cây gỗ trên núi đá vôi. Tuy nhiên do sự chia cắt, nên Voọc mông trắng sống cả trong những sinh cảnh rừng nghèo, thậm chí chỉ có dây leo bụi rậm (Vân Long, Ninh Bình). Cũng như các loài trên, Voọc mông trắng sống đàn. Kết quả khảo sát thực địa cho thấy số lượng con trong đàn biến đổi từ 5 đến 10 con. Vùng hoạt động kiếm ăn của Voọc mông trắng tương đối rộng, cả trên núi đất lẫn núi đá nhưng chúng ngủ trên núi đá. Mùa nóng, Voọc mông trắng ngủ trên vách đá, mùa lạnh ngủ hang. Kiếm ăn ngày hai buổi sáng và chiều, trưa nghỉ. Nghiên cứu trong điều kiện nuôi nhốt cho thấy Voọc thường có giấc ngủ trưa bắt đầu từ khoảng 12 giờ và tỉnh dậy vào khoảng 13 giờ. Thời gian ngủ trưa kéo dài từ 37 đến 60 phút. Voọc mông trắng ăn lá, chồi non và quả cây rừng.\nDẫn liệu sinh sản Voọc mông trắng còn ít. Quan sát tại Trung tâm cứu hộ thú Linh trưởng Primates Cúc Phương cho thấy hoạt động giao phối của Voọc mông trắng thường diễn ra vào hai thời điểm sáng sớm và sau buổi ăn chiều. Thời gian giao phối kéo dài 15 dến 30 giây. Thời gian mang thai trung bình 196 ngày. Mùa sinh sản tập trung từ tháng 12 đến tháng 8. Mỗi lứa đẻ một con, con sơ sinh nặng 350 - 500g. Bộ lông con sơ sinh màu vàng. Voọc trưởng thành sinh dục sau 5 năm tuổi\nKhông ăn động vật. Nghiên cứu thức ăn tại Trung tâm cứu hộ thú Linh trưởng Cúc Phương đã ghi nhận được Voọc mông trắng ăn 204 loài thực vật thuộc 57 Họ. Trong 204 loài thực vật làm thức ăn, Voọc mông trắng ăn chồi lá 203 loài, ăn hoa của 16 loài, quả của 13 loài, củ 3 loài và ăn vỏ của 10 loài. Nhu cầu thức ăn trung bình ngày là 1184g, (bằng 16.91% trọng lượng cơ thể) và phụ thuộc vào giới tính, tuổi và thời tiết (chủ yếu là nhiệt độ) trong ngày. Lượng nước uống trong ngày biến động từ 400 đến 500 ml/con. Kẻ thù tự nhiên của chúng là các loài thú ăn thịt lớn', NULL, 'Yên Bái (Văn Chấn), Hoà Bình (Chi Nê), Ninh Bình (Cúc Phương, Vân Long), Thanh Hoá (Hồi Xuân, Lang Chánh), Nghệ An (Quỳ Châu, Con Cuông), Hà Tĩnh (Hương Sơn) Chỉ có ở Việt Nam', NULL, 'Chỉ có ở Việt Nam', 'Voọc mông trắng là nguồn gen đặc hữu, qúy hiếm. Theo dõi tập tính sinh thái của chúng để tìm hiểu về tiến hóa của con người', 'EN', 'CR A1c,d C1+2a', NULL, 'VnCreature'),
(4521, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Cercopithecidae', 'Khỉ', 'FAM_068', 'Trachypithecus', NULL, 'GEN_1972', 'trachypithecusfrancoisi', 'Trachypithecus francoisi', '(De Pousargues, 1898). ', 'Voọc má trắng', 'SPA_04562', 'Bộ lông dày, màu đen tuyền. Hai má trắng, đám lông trắng rộng vượt quá chỏm vành tai. Đầu thường có mào lông đen. Đuôi dài hơn thân, mầu đen. Voọc đen má trắng chủ yếu sống ở rừng trên núi đá vôi và kiếm ăn trong các dải rừng kín thường xanh tiếp giáp với rừng núi đá vôi gân vung sống của chúng. Voọc đen má trắng sống đàn. Trước đây, đàn voọc thường rất đông, 20 - 30 con (Lê Hiền Hào, 1973), nhưng hiện nay phổ biến tư 5 đến 15 con (Phạm Nhật, 2000). Hoạt động kiếm ăn của Voọc đen má trắng diễn ra ngay hai buổi sáng và chiều, trưa nghỉ. Cường độ kiếm ăn của voọc má trắng diễn ra mạnh vào hai thời điểm, đầu buổi sáng đến khoảng 10 giờ và từ 14 giờ đến 16 giờ 30 phút. Thời gian hoạt động trong ngày có khác nhau. Mùa nóng Voọc rời chỗ ngủ sớm, về hang muộn va thời gian nghỉ trưa khá dài. Về mùa lạnh, chúng đi kiếm ăn muộn và về hang ngủ sớm. Voọc đen má trắng ăn lá chồi non và quả cây rừng, không ăn động vật.\nBước đầu đã ghi nhận được 44 loài thuộc 22 họ thực vật được Voọc đen má trắng sử dụng làm thức ăn (Pham Nhật, 2000). Có nhiều loài thực vật được Voọc đen má trắng thích ăn nhất là cây họ Dâu tằm Moraceae, Ba mảnh vỏ Ephorbiaceae, Cau dừa Arecaceae. Các số liệu nghiên cứu cho thấy tuy Voọc má trắng ăn rất nhiều loại quả nhưng trong khẩu phần thức ăn thì khối lượng lá, đặc biệt là cuộng chiếm tỷ lệ nhiều hơn các loại thức ăn quả và thân. Voọc đen má trắng chủ yếu ngủ hang. Mùa nóng, chúng ngủ trên những tảng đá hoặc cây gỗ trước cửa hang, mùa lạnh ngủ trong hang. Hang ngủ của Voọc thường tìm thấy ở những nơi vách đá dựng đứng. Dẫn liệu sinh sản của Voọc đen má trắng còn thiếu. Quan sát thực địa thường gặp con mẹ mang con non ở các tháng khác nhau của năm, nhưng tập chung từ tháng 3 đến tháng 7. Mỗi lứa đẻ một con, con non mới đẻ có bộ lông màu vàng.', NULL, 'Hà Giang, Cao Bằng, Tuyên Quang, Bắc Kạn, Lạng Sơn. : Trung Quốc (Quảng Tây)', NULL, NULL, 'Voọc đen má trắng là loài linh trưởng quý hiếm và có giá trị khoa học, thẩm mỹ.', 'EN', NULL, NULL, 'vncreatures'),
(4522, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Cercopithecidae', 'Khỉ', 'FAM_068', 'Trachypithecus', NULL, 'GEN_1972', 'trachypithecusmargarita', 'Trachypithecus margarita', '(Elliot, 1909)', 'Vooc bạc', 'SPA_04563', 'Thân hình thon nhỏ, lông trên đỉnh đầu có màu tối xám. Thân màu xám tới màu đen với những chóp lông màu xám hay vàng nhẹ, tạo nên như ánh bạc. Mặt trắng nhạt, phía bụng màu xám nhạt. Chân tay dài, đuôi dài, phần dưới đuôi có màu hơi vành nhạt. Con mới sinh có màu da cam và chuyển thành màu xám ở tuổi 3 - 4 tháng. Thức ăn chủ yếu là lá cây 80%, chồi cây 10%, quả 10%. Vào khoảng 100 loài thực vật dùng làm thức ăn cho loài. Chưa có trường hợp nào quan sát thấy ăn động vật. Là loài hoạt động vào ban ngày và ở trên cây. Trong đàn một con đực dẫn đầu. Con non có màu vàng da cam rất rõ trong vòng 6 tuần tuổi. Con đực ít chú ý tới con non hơn. Cấu trúc đàn là một đực và nhiều cái. Số lượng con trong đàn 15 - 38. Sinh cảnh chính là rừng thường xanh, rừng nguyên sinh, thứ sinh, rừng ngập mặn ven biển, bìa rừng dọc các con sông. Chúng thích sống ở các vùng núi thấp dưới 500m nhưng cũng phát hiện thấy chúng ở độ cao trên 1.000m (1.737m). Thường sống và kiếm ăn trên độ cao10 - 50m.', NULL, 'Gia Lai (A Zun Ba), Kontum (Đắk lây, Đắk Tô, Mom Ray, Sa Thầy), Đắk Lắk (Đắk Nông, Buôn Ma Thuột, Ea Súp, Buôn Đôn), Phú yên, Nha Trang, Lâm Đồng, Đồng Nai (Cát Tiên), Kiên Giang. Nam và Đông nam Á.', NULL, NULL, 'Có giá trị khoa học cao, là đối tượng nghiên cứu khoa học, nuôi làm vật thí nghiệm nghiên cứu Vaccine phục vụ đời sống con người.', 'VU', NULL, NULL, 'vncreatures'),
(4523, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Cercopithecidae', 'Khỉ', 'FAM_068', 'Trachypithecus', NULL, 'GEN_1972', 'trachypithecusphayrei', 'Trachypithecus phayrei', 'Blyth,1847', 'Voọc xám', 'SPA_04564', 'Bộ lông màu xám tro tới màu nâu đen, trên đầu có mào lông, da bao quanh mắt có màu xanh và trắng. Lông ở vùng lưng thẫm hơn ở vùng bụng. Bên hông có các lông dài, đầu lông có ánh bạc. Đuôi dài hơn thân, lông đuôi rất dài. Chân tay có màu đen, phần trên cánh tay, chân và đuôi có màu xám bạc. Thức ăn chủ yếu là quả 24,4%, lá 58,4%, các loại khác 9,7%. Voọc xám sinh sản quanh năm. Gặp voọc cái có chửa vào tháng 3 và tháng 7. Gặp voọc mẹ mang con trên ngực vào tháng 4, 6, 10, 12. Mỗi lứa đẻ một con, con non màu vàng nhạt. Voọc xám thường sinh sống ở những vùng rừng cây cao trên núi đá vôi, không sống trên rừng hỗn giao tre nứa. Hoạt động vào ban ngày. Cuộc sống leo trèo trên cây. Có thể gặp chúng kiếm ăn ở vùng đồi cây bụi gần rừng. Thường ngủ trên các vánh núi đá vôi dựng đứng hoặc trên các gốc cây mọc ở vách núi treo leo. Mùa đông ngủ trong hang hoặc trên các tán cây rậm kín gió. Voọc xám sống chung với khỉ mốc, khỉ vàng nhưng không cạnh tranh về thức ăn. Kẻ thù tự nhiên là các loài thú ăn thịt cỡ lớn. Chúng sống thành từng nhóm từ 3- 30 cá thể.', NULL, ' Lai Châu (Mường Nhé, Mường Tè), Hà Tây, Hoà Bình (Kim Bôi), Thanh Hoá ( Hồi Xuân, Thường Xuân), Ninh Bình (Cúc Phương), Nghệ An (Nghĩa Đàn, Quế Phong, Kỳ Sơn), Hà Tĩnh (Anh Sơn), Quảng Bình (Bố Trạch, Tuyên Hoá, Minh Hoá) Mianma, Nam Trung Quốc, Thái Lan, Lào, Cămpuchia.', NULL, NULL, 'Có giá trị khoa học cao có thể dùng làm mẫu vật nghiên cứu, dùng để nuôi làm cảnh ở các vườn thú hay công viên hoang dã.', 'VU', NULL, NULL, 'vncreatures'),
(4524, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Cercopithecidae', 'Khỉ', 'FAM_068', 'Trachypithecus', NULL, 'GEN_1972', 'trachypithecuspoliocephalus', 'Trachypithecus poliocephalus', '(Trouesart, 1911)', 'Voọc cát bà', 'SPA_04565', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4525, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Hylobatidae', 'Vượn', 'FAM_193', 'Hylobates', NULL, 'GEN_0925', 'hylobatesgabriellae', 'Hylobates gabriellae', '(Thomas, 1909)', 'Vượn đen má vàng', 'SPA_04566', 'Có bộ lông dày và mềm. Con đực có màu đen, trên hai má có hai đám lông màu vàng nhạt. Trên đỉnh đầu có đám lông dựng đứng như cái mào. Trọng lượng thường từ 6 - 10 kg. Đám lông trước ngực màu nâu, không phải màu đen. Chân tay dài không có đuôi. Con cái có màu lông không phải màu đen. Lưng và đùi có màu vàng nhạt không phải xám hoặc nâu. Có một túm lông màu thẫm thẳng đứng trên đỉnh đầu. Trọng lượng trung bình từ 6 - 10 kg. Lông ở ngực màu xám. Lông quanh mặt thường màu vàng. Lông hai bên má thường thẳng ra phía ngoài. Kiếm ăn trên cây cao. Thức ăn là lá cây, chồi non, quả cây và côn trùng, trứng chim, chim non trong tổ. Bắt đầu sinh sản vào năm thứ 7 - 8. thời gian có chửa 7 - 8 tháng. Hai năm đẻ một lần, mỗi lần đẻ một con. Vượn đen thường sống trong sinh cảnh rừng già trên đỉnh núi cao. Thường sống trong các khu rừng già, rậm. Không sống trong rừng thưa, rừng tre lứa. Vượn sống thành từng nhóm nhỏ như một gia đình; Gồm một đực già, 1 - 2 con cái và các con của chúng. Một nhóm có một khu vực cư trú riêng tách biệt với các nhóm khác. Đôi khi gặp những nhóm nhỏ tách khỏi đàn để lập nhóm mới, hoạt động vào ban ngày và tích cực nhất vào sáng sớm và chiều tối. Trưa và ban đêm ngồi nghỉ trên ngọn cây. Thường hay kêu hú vào sáng sớm.', NULL, 'Quảng Nam (Sông Thanh), Đà Nẵng (Sơn Trà), Gia Lai (Kon Ka Kinh, Kon Cha Răng, Cheo Reo), Kontum (Sa Thày, Ngọc Linh), Lâm Đồng (Bảo Lộc), Khánh Hoà, Đồng Nai (Vườn quốc gia Cát Tiên). Cămpuchia.', NULL, NULL, 'Là đối tượng nghiên cứu khoa học, tìm hiểu sinh thái tập tính của loài trong tự nhiên để tìm hiểu về tiến hóa.', 'EN', NULL, NULL, 'vncreatures.net'),
(4526, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Hylobatidae', 'Vượn', 'FAM_193', 'Hylobates', NULL, 'GEN_0925', 'hylobatesleucogenus', 'Hylobates leucogenus siki', '(Delacour, 1951)', 'Vượn đen má hung trung bộ', 'SPA_04567', 'Đặc điểm nhận dạng:\n\nThân hình thon nhẹ, chân tay dài. Con đực có màu đen toàn thân, hai má lông màu trắng nối nhau bằng vệt trắng dưới cằm. Con cái lông màu vàng xẫm, lồng quanh mặt tủa ngang, đỉnh đầu màu xám hoặc tua đen. Vượn con cả đực và cái đều có lông màu vàng nhạt.\n\nSinh học, sinh thái:\n\nKiếm ăn trên cây cao. Thức ăn là quả, hạt, lá, chồi cây, côn trùng, trứng chim, chim non trong tổ. Sinh sản vào lúc 8 - 9 tuổi. thời gian có chửa 200 - 214 ngày, mỗi năm đẻ một lứa, mỗi lứa đẻ một con. Sống trong rừng già trên đỉnh núi cao, thường là núi đá. Sống thành từng đàn từ 3-7 con như một gia đình. Hoạt động kiếm ăn ban ngày vào buổi sáng và chiều, di chuyển nhẹ nhàng nhanh nhẹn trên cây, ít khi xuống mặt đất.', NULL, 'Trong nước: Lai Châu (Mường Tè), Sơn La (Mường La, Sông Mã), Hoà Bình (Chi Nê), Thanh Hoá (Hồi Xuân), Nghệ An (Quỳ Châu).\n\nThế giới: Lào.', NULL, NULL, 'Là đối tượng nghiên cứu khoa học. Dùng để nuôi làm cảnh trong các công viên, vườn thú.', 'EN', NULL, NULL, 'vncreatures'),
(4527, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Hylobatidae', 'Vượn', 'FAM_193', 'Nomascus', NULL, 'GEN_1332', 'nomascusconcolor', 'Nomascus concolor', '(Harlan, 1826)', 'Vượn đen', 'SPA_04568', 'hân hình thon mảnh, chân tay dài, không có đuôi. Con đực trưởng thành màu đen tuyền. Một số lông trắng đơn lẻ có thể xuất hiện ở góc miệng. Con cái trưởng thành màu vàng nhạt, vàng, cam, nâu be hoặc trắng đục. Con cái trưởng thành thường có đốm đen ở đỉnh đầu và ở dưới ngực. Vượn đen non có màu vàng nhạt.', NULL, 'Trong nước: Tây Bắc Việt Nam, Bắc Kạn (Na Rì), Quảng Ninh, Thanh Hoá . Thế giới: Nam Trung Quốc, Bắc Lào.', NULL, NULL, NULL, NULL, 'CR', 'IB (ND32)', 'https://www.vncreatures.net/chitiet.php?page=3&loai=1&ID=5521'),
