(4529, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Hylobatidae', 'Vượn', 'FAM_193', 'Nomascus', NULL, 'GEN_1332', 'nomascusleucogenys', 'Nomascus leucogenys', 'Ogilby, 1840', 'Vượn đen má trắng', 'SPA_04570', 'Thân hình thon nhẹ, chân tay dài. Con đực có màu đen toàn thân, hai má lông màu trắng nối nhau bằng vệt trắng dưới cằm. Con cái lông màu vàng xẫm, lồng quanh mặt tủa ngang, đỉnh đầu màu xám hoặc tua đen. Vượn con cả đực và cái đều có lông màu vàng nhạt. Kiếm ăn trên cây cao. Thức ăn là quả, hạt, lá, chồi cây, côn trùng, trứng chim, chim non trong tổ. Sinh sản vào lúc 8 - 9 tuổi. thời gian có chửa 200 - 214 ngày, mỗi năm đẻ một lứa, mỗi lứa đẻ một con. Sống trong rừng già trên đỉnh núi cao, thường là núi đá. Sống thành từng đàn từ 3-7 con như một gia đình. Hoạt động kiếm ăn ban ngày vào buổi sáng và chiều, di chuyển nhẹ nhàng nhanh nhẹn trên cây, ít khi xuống mặt đất.', NULL, 'Trong nước: Lai Châu (Mường Tè), Sơn La (Mường La, Sông Mã), Hoà Bình (Chi Nê), Thanh Hoá (Hồi Xuân), Nghệ An (Quỳ Châu). Thế giới: Lào.', NULL, NULL, 'Là đối tượng nghiên cứu khoa học. Dùng để nuôi làm cảnh trong các công viên, vườn thú.', 'EN', 'CR', NULL, 'VnCreature'),
(4530, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Hylobatidae', 'Vượn', 'FAM_193', 'Nomascus', NULL, 'GEN_1332', 'nomascusnasutus', 'Nomascus nasutus', '(Künckel d\`Herculais, 1884)', 'Vượn đen đông bắc', 'SPA_04571', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4531, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Lorisidae', 'Cu Li', 'FAM_222', 'Nycticebus', NULL, 'GEN_1343', 'nycticebusbengalensis', 'Nycticebus bengalensis', '(Lacépède, 1800)', 'Cu li lớn', 'SPA_04572', 'Đầu tròn, trên đỉnh đầu có sọc màu nâu sẫm. Mắt trố to. Xung quanh hai mắt có vòng lông màu nâu đỏ. Từ trên đỉnh đầu có hai sọc nhỏ màu nâu nhạt chạy xuống dưới mắt. Từ hai gốc tai có vệt lông màu nâu nhạt chạy lên đỉnh đầu và liên kết với nhau. Dải lông màu nâu sẫm chạy dọc từ trên đỉnh đầu theo sống lưng xuống phía dưới. Lông mịn màng, có màu vàng đỏ, cũng có thể có màu vàng nhạt hoặc màu xám. Ngực thường có màu xám tro. Bụng màu hơi vàng nhạt. Hông và chân sau có màu đỏ hoe. Kích thước cỡ nhỏ. Dài thân: 260 - 310mm, dài đuôi: 19 - 40mm. Ngón tay trỏ nhỏ, ngón chân thứ hai có vuốt, các ngón khác có ống. Răng hàm thứ nhất lớn hơn răng hàm thứ hai.\n\nSinh học, sinh thái:\n\nCon đực và con cái trưởng thành sau 21 tháng. Thời gian mang thai 191 ngày. Khoảng cách giữa các lần sinh từ 12 - 18 tháng. Cuộc sống kéo dài khoảng 20 năm. Thức ăn chủ yếu là quả cây: 50%, các loài động vật: 30%, đặc biệt là các loài côn trùng. Hoạt động về ban đêm. Ban ngày ngủ trên cây cuộn tròn, mặt cúi vào trong lòng. Chúng thường làm tổ trên các hốc cây. Cuộc sống leo trèo. Sống đơn độc hoặc thành nhóm 3 - 4 cá thể. Khu vực sống chủ yếu là các rừng tre nứa, rừng nguyên sinh, cây bụi, các khu vườn thứ sinh. Chúng thích các vị trí trên đỉnh núi hoặc đỉnh giông có thể cao tới 1300m so với mực nước biển.', NULL, 'Trong nước: Yên Bái (Ta Lang), Tuyên Quang (Bản Bung, Tát Kẻ), Bắc Kạn (Đình Cả, Bản Thi, Ba Bể, Chợ Rã), Lạng Sơn (Hoa Thong), Bắc Ninh (Thăng Long), Hoà Bình (Đà Bắc), Quảng Trị (Lao Bảo), Thừa Thiên - Huế (Bạch Mã), Gia Lai (Koncharang), Kontum (Sa Thầy, Mom Ray).\n\nThế giới: Bănglađét, Mianma, Trung Quốc, Lào, Cămpuchia, Thái Lan, Malaixia, Inđônêxia', NULL, NULL, NULL, 'VU A1c,d', NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5508'),
(4532, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Lorisidae', 'Cu Li', 'FAM_222', 'Nycticebus', NULL, 'GEN_1343', 'nycticebuscoucang', 'Nycticebus coucang', '(Boddaert, 1785)            ', 'Cu li lớn', 'SPA_04573', 'Đầu tròn, trên đỉnh đầu có sọc màu nâu sẫm. Mắt trố to. Xung quanh hai mắt có vòng lông màu nâu đỏ. Từ trên đỉnh đầu có hai sọc nhỏ màu nâu nhạt chạy xuống dưới mắt. Từ hai gốc tai có vệt lông màu nâu nhạt chạy lên đỉnh đầu và liên kết với nhau. Dải lông màu nâu sẫm chạy dọc từ trên đỉnh đầu theo sống lưng xuống phía dưới. Lông mịn màng, có màu vàng đỏ, cũng có thể có màu vàng nhạt hoặc màu xám. Ngực thường có màu xám tro. Bụng màu hơi vàng nhạt. Hông và chân sau có màu đỏ hoe. Kích thước cỡ nhỏ. Dài thân: 260 - 310mm, dài đuôi: 19 - 40mm. Ngón tay trỏ nhỏ, ngón chân thứ hai có vuốt, các ngón khác có ống. Răng hàm thứ nhất lớn hơn răng hàm thứ hai. Con đực và con cái trưởng thành sau 21 tháng. Thời gian mang thai 191 ngày. Khoảng cách giữa các lần sinh từ 12 - 18 tháng. Cuộc sống kéo dài khoảng 20 năm. Thức ăn chủ yếu là quả cây: 50%, các loài động vật: 30%, đặc biệt là các loài côn trùng. Hoạt động về ban đêm. Ban ngày ngủ trên cây cuộn tròn, mặt cúi vào trong lòng. Chúng thường làm tổ trên các hốc cây. Cuộc sống leo trèo. Sống đơn độc hoặc thành nhóm 3 - 4 cá thể. Khu vực sống chủ yếu là các rừng tre nứa, rừng nguyên sinh, cây bụi, các khu vườn thứ sinh. Chúng thích các vị trí trên đỉnh núi hoặc đỉnh giông có thể cao tới 1300m so với mực nước biển.', NULL, 'Trong nước: Yên Bái (Ta Lang), Tuyên Quang (Bản Bung, Tát Kẻ), Bắc Kạn (Đình Cả, Bản Thi, Ba Bể, Chợ Rã), Lạng Sơn (Hoa Thong), Bắc Ninh (Thăng Long), Hoà Bình (Đà Bắc), Quảng Trị (Lao Bảo), Thừa Thiên - Huế (Bạch Mã), Gia Lai (Koncharang), Kontum (Sa Thầy, Mom Ray). Thế giới: Bănglađét, Mianma, Trung Quốc, Lào, Cămpuchia, Thái Lan, Malaixia, Inđônêxia', NULL, NULL, 'Thú quý và cổ trong bộ linh trưởng, có vị trí đặc biệt trong nghiên cứu tiến hóa và thích nghi với đời sống trên cây. Mặt khác dễ nuôi, rất hấp dẫn trong các vườn thú nên có thể nuôi nhân giống để xuất khẩu.', 'VU', 'VU', NULL, 'VnCreature'),
(4533, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PRIMATES', 'LINH TRƯỞNG', 'ORD_069', 'Lorisidae', 'Cu Li', 'FAM_222', 'Nycticebus', NULL, 'GEN_1343', 'nycticebuspygmaeus', 'Nycticebus pygmacus', 'Bonhote. 1907', 'Cu li nhỏ', 'SPA_04574', 'Giống như Cu li lớn Nycticebus bengalensis, nhưng nhỏ hơn và ở lưng màu vàng hơn. Xung quanh hai mắt có vòng tròn lông màu nâu sẫm. Có hai dải lông màu nâu sẫm chạy từ đỉnh đầu xuống trên hai mắt. Từ hai gốc tai có hai vệt rộng màu nâu đỏ chạy từ trên đỉnh đầu và nối với nhau. Lông mềm mại, màu hung nâu xen kẽ ít lông trắng bạc. Dọc sống mũi có vệt trắng. Dọc sống lưng không có sọc hoặc rất mờ, bụng trắng vàng ánh bạc. Răng hàm thứ hai lớn hơn răng hàm thứ nhất. Ngón chân thứ 2 có vuốt, các ngón chân khác có móng. Con cái trưởng thành sau 9 tháng, con đực sau 17 - 20 tháng. Thời gian mang thai kéo dài 188 ngày (Weisenseel, 1995). Mùa sinh sản vào tháng 10 đến tháng 12. Mỗi lứa đẻ 1 - 2 con. Tuổi thọ kéo dài 20 năm (Kappeler, 1991). Thức ăn là quả, nõn cây, côn trùng, trứng chim, chim non trong tổ và chúng thường ăn nhựa cây (Tan, 1994). Hoạt động kiếm ăn ban đêm. Thích leo trèo, chuyển động nhanh hơn loài Cu li lớn (Tan, 1994). Sống đơn độc hay thành nhóm nhỏ 3 - 4 con. Chúng sống trong nhiều sinh cảnh khác nhau. Thích nghi với điều kiện rừng thưa, thoáng, trên các gốc cây, bụi rậm, ven rừng, trên nương rẫy.', NULL, 'Trong nước: Thừa Thiên - Huế (Bạch Mã), Quảng Nam, Đà Nẵng (Sơn Trà), Kontum (Sa Thày), Gia Lai (An Khê, Kon Hà Nừng, Koncharang, Kon Ka Kinh), Đắk Lắk (Buôn Ma Thuột, Yok Don, Nam Ca, EaSup, EaKar, Đắk Nông), Lâm Đồng (Bảo Lộc), Khánh Hoà (Nha Trang), Bình Phước, Đồng Nai, Thành phố Hồ Chí Minh đến Cà Mau Thế giới: Lào, Cambodia.', NULL, NULL, 'Loài thú Linh trưởng rất cần cho các nghiên cứu khoa học nhằm tìm hiểu tiến hóa của các loài Linh trưởng.', 'VU', NULL, NULL, 'VnCreature'),
(4534, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'PROBOSCIDEA', 'CÓ VÒI', 'ORD_070', 'Elephantidae', 'Voi', 'FAM_131', 'Elephas', NULL, 'GEN_0639', 'elephasmaximus', 'Elephas maximus', 'Linnaeus, 1758            ', 'Voi châu Á', 'SPA_04577', 'Da gần như trần trụi. Đuôi có một hàng lông thô dài vài inch ở phía trước và phía sau và chỉ làm tròn phần đuôi. Bình thường mỗi bàn chân trước có năm móng, mỗi bàn chân sau có bốn móng. Số đường vân trên mỗi răng hàm từ răng hàm đầu tiên đến răng hàm cuối cùng là 4, 8, 12, 12, 16 và 24, có sự thay đổi nhỏ. Con đực thường có ngà phát triển tốt; một số con đực, ở Ấn Độ được gọi là makna, chỉ có ngà ngắn giống con cái. Màu xám đen toàn bộ. Trán, gốc thân và tai thường có đốm màu thịt. Voi trắng là loài bạch tạng. Đầu thuôn dài, trán lõm; thân răng hàm có đường gờ ngang hẹp; bàn chân sau có 4 ngón; tai vừa phải; ngà lớn ở con đực, ngà nhỏ ở con cái. So với voi châu Phi loài này có đôi tai nhỏ hơn nhiều. Ở phiên bản đầu, đầu tròn hơn; những người mài tạo ra những vết nổi hình thoi rộng trên vương miện của họ; và chúng thường chỉ có 3 ngón chân ở bàn chân sau. Số cặp xương sườn là 19 cặp ở voi Ấn Độ, 21 ở voi châu Phi, và có 33 đốt sống đuôi ở voi Ấn Độ và không bao giờ nhiều hơn 26 ở voi châu Phi. Ở một số con đực chỉ có một chiếc ngà được phát triển; và ở Ceylon nhiều con voi đực có ngà rất nhỏ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'indiabiodiversity.'),
(4535, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Hystricidae', 'Nhím', 'FAM_195', 'Acanthion', NULL, 'GEN_0008', 'acanthionbrachyurus', 'Acanthion brachyurus', '(Linnaeus,1758)            ', 'Nhím đuôi ngắn', 'SPA_04578', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4536, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Hystricidae', 'Nhím', 'FAM_195', 'Acanthion', NULL, 'GEN_0008', 'acanthionsubcristatum', 'Acanthion subcristatum', '(Swinhoe, 1870)', 'Nhím bờm', 'SPA_04579', 'Chúng là loài gặm nhấm có kích thước lớn. Trọng lượng từ 20–27 kg, nặng trung bình từ 15–20 kg. Thậm chí có con nặng tới 26 kg (ngang với con chó béc-gê). Chiều dài cơ thể từ đầu cho tới mút đuôi dài tới gần 1 mét (thân và đuôi dài từ 80–90 cm). Chiều dài đầu và thân: 63-725mm. Chiều dài đuôi: 64-114mm[3]. Mình nó tròn, đầu to, mõm ngắn và đi lại lặc lè, hình dáng nặng nề. Tuy nhiên, khi có động, nó chạy rất nhanh. Tai và đuôi ngắn, có những sợi lông phía đầu phình ra thành hình cốt rỗng ruột màu trắng. Nhím đực mỏ dài, đầu nhọn, thân hình thon dài, đuôi dài hơn con cái, dưới háng có hai dịch hoàn và nhô ra phía trước bụng, cách lỗ hậu môn khoảng 4–5 cm. Mắt nhím như mắt chuột và hai tai lại nhỏ. Nhím có hai đôi chân. Chân chúng ngắn, 2 chân sau ngắn hơn hai chân trước. Bộ móng rất sắc và cứng, mọc dài ra và trở thành công cụ đào bới của chúng để bới rễ, bói củ cây rừng và đào hang trú ẩn. ', NULL, 'từ các tỉnh phía Bắc vào tới tỉnh Khánh Hòa, loài này phân bố khắp các kiểu rừng từ Bắc đến Nam ở độ cao trung bình dưới 2.000m ', NULL, NULL, NULL, NULL, NULL, NULL, 'vi.wikipedia.org'),
(4537, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Hystricidae', 'Nhím', 'FAM_195', 'Antherurus', NULL, 'GEN_0115', 'antherurusmacrourus', 'Antherurus macrourus', '(Linnaeus, 1758)', 'Đon', 'SPA_04581', 'Đon loài thú nhỏ trong họ nhím Hisricidae, cân nặng 3 - 5 kg, dài thân 380 - 500mm, dài đuôi 139 - 228mm, Đặc điểm để phân biệt với nhím là lông gai trâm thô, thưa, ngắn (70 - 100mm) và dẹp, (không tròn như Nhím Hystrix brachyura). Đuôi dài và có một chùm lông đuôi lớn như chiếc bàn chải ở chót đuôi, chân tay ngắn và mập mạp, tai tròn. Mắt và tai khá nhỏ.  Bàn chân trước và chân sau có năm ngón, vuốt thẳng. Nệm chân dày, mềm giúp chúng chuyện động êm trong rừng vào đêm tối.', NULL, ' Nam: hầu hết ở các vùng còn rừng, đặc biệt là các khu vực núi có nhiều hang đá sâu.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5582'),
(4538, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Hystricidae', 'Nhím', 'FAM_195', 'Atherurus', NULL, 'GEN_0180', 'atherurusmacrourus', 'Atherurus macrourus', '(Linnaeus, 1758)            ', 'Đon', 'SPA_04582', 'Đon loài thú nhỏ trong họ nhím Hisricidae, cân nặng 3 - 5 kg, dài thân 380 - 500mm, dài đuôi 139 - 228mm, Đặc điểm để phân biệt với nhím là lông gai trâm thô, thưa, ngắn (70 - 100mm) và dẹp, (không tròn như Nhím Hystrix brachyura). Đuôi dài và có một chùm lông đuôi lớn như chiếc bàn chải ở chót đuôi, chân tay ngắn và mập mạp, tai tròn. Mắt và tai khá nhỏ.  Bàn chân trước và chân sau có năm ngón, vuốt thẳng. Nệm chân dày, mềm giúp chúng chuyện động êm trong rừng vào đêm tối. Đon chủ yếu sống ở rừng trên núi đá vôi hay nơi có nhiều đá lộ đầu, ở trong các hang, hốc đá tự nhiên. Là loài động vật nhanh nhẹn và có thể chạy, leo lên, và bơi tốt. Thức ăn gần giống nhím và có khả năng thích nghi với nhiều môi trường khác nhau từ rừng nguyên sinh đến các vùng đất canh tác. Sống theo bầy đàn từ 6 - 8 con. Ban ngày ẩn nấp trong gốc cây. Kiếm ăn ban đêm.', NULL, 'hầu hết ở các vùng còn rừng, đặc biệt là các khu vực núi có nhiều hang đá sâu. Thái Lan, miền Đông Mianma, Lào, Cambodia, Malaixia, Indonesia.', NULL, NULL, 'Đây là nguồn thực phẩm có giá trị cho đồng bào dân tộc, Đon cũng là loài gây một số tác hại cho sản phẩm nông lâm nghiệp.', NULL, NULL, NULL, 'vncreatures.net'),
(4539, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Hystricidae', 'Nhím', 'FAM_195', 'Hystrix', NULL, 'GEN_0945', 'hystrixbrachyura', 'Hystrix brachyura', 'Linnaeus, 1758            ', 'Nhím đuôi ngắn', 'SPA_04583', 'Chiều dài đầu - thân: 635 - 725mm. Chiều dài đuôi: 64 - 114mm. Trọng lượng: 20 - 27 kg. Kích thước lớn, tai và đuôi ngắn. Bộ lông màu đen hoặc nâu sẫm. Trên lưng có lông cứng, nhọn, dài, mọc chĩa thằng về phía sau. Chân lông màu trắng. Một đôi sợi có vòng đen chen lẫn. Lông bờm dài 30 - 60mm, màu nâu sẫm.\n\nSinh học, sinh thái:\n\nCó khả năng thích nghi với nhiều môi trường khác nhau, từ rừng nguyên sinh đến rừng suy thoái. Ban ngày ngủ trong các hang hốc tự đào, miệng hang có cây cỏ mọc xum xuê. Kiếm ăn vào ban đêm. Thức ăn gồm rễ cây, măng, vỏ cây, quả chín rụng xuống đất, xương động vật, sừng hươu, hoẵng bị lột bỏ. Chúng thường tha xương động vật hay sừng hươu hoẵng vào hang gặm nhấm để răng cửa không mọc quá dài.\n\nKhi gặp kẻ thù nhím thể hiện động tác đe dọa bằng cách dậm chân, xù lông và quay đuôi tạo ra tiếng động to. Nếu không kết quả chúng sẽ rút lui. Nếu kẻ thù tiếp tục truy đuổi, chúng sẽ bỏ chạy nhanh, sau đó đột ngột dừng lại, làm cho kẻ thù bị lông đâm. Nhím lắc đuôi liên tục làm cho lông va chạm nhau phát ra tiếng động. Qua nghiên cứu thấy rằng việc lắc đuôi như vậy để thể hiện khả năng uy lực của mình. Mỗi lần đẻ 2 - 3 con. Trong trại nuôi dưỡng chúng có tuổi thọ trên 27 năm.', NULL, 'Nêpan, Ấn Độ, Bhutan, Trung Quốc, Bangladesh, Mianma, Thái Lan, Lào, Campuchia, Malaixia, đảo Xumatơra, đảo Bocnêo, Việt Nam. Ở Việt Nam loài này phân bố khắp các kiểu rừng từa Bắc đến Nam ở độ cao trung bình dưới 2.000m.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=4&loai=1&ID=5581'),
(4540, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Hystricidae', 'Nhím', 'FAM_195', 'Hystrix', NULL, 'GEN_0945', 'hystrixhadgsson', 'Hystrix hadgsson', NULL, ' Nhím', 'SPA_04584', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4541, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Hystricidae', 'Nhím', 'FAM_195', 'Hystrix', NULL, 'GEN_0945', 'hystrixsubcristata', 'Hystrix subcristata', 'Linnaeus, 1758', 'Nhím đuôi bờm', 'SPA_04585', 'Chúng là loài gặm nhấm có kích thước lớn. Trọng lượng từ 2–27 kg, nặng trung bình từ 15–2 kg. Thậm chí có con nặng tới 26 kg (ngang với con chó béc-gê). Chiều dài cơ thể từ đầu cho tới mút đuôi dài tới gần 1 mét (thân và đuôi dài từ 8–9 cm). Chiều dài đầu và thân: 63-725mm. Chiều dài đuôi: 64-114mm[3]. Mình nó tròn, đầu to, mõm ngắn và đi lại lặc lè, hình dáng nặng nề. Tuy nhiên, khi có động, nó chạy rất nhanh. Tai và đuôi ngắn, có những sợi lông phía đầu phình ra thành hình cốt rỗng ruột màu trắng. Nhím đực mỏ dài, đầu nhọn, thân hình thon dài, đuôi dài hơn con cái, dưới háng có hai dịch hoàn và nhô ra phía trước bụng, cách lỗ hậu môn khoảng 4–5 cm. Mắt nhím như mắt chuột và hai tai lại nhỏ. Nhím có hai đôi chân. Chân chúng ngắn, 2 chân sau ngắn hơn hai chân trước. Bộ móng rất sắc và cứng, mọc dài ra và trở thành công cụ đào bới của chúng để bới rễ, bói củ cây rừng và đào hang trú ẩn.', NULL, 'Nhím bờm của Việt Nam phân bố khá rộng, từ các tỉnh phía Bắc vào tới tỉnh Khánh Hòa, loài này phân bố khắp các kiểu rừng từ Bắc đến Nam ở độ cao trung bình dưới 2.m[3]. Tuy nhiên, cũng có thể bắt gặp nhím ở Đắk Nông, Đắk Lắk, Đồng Nai, chúng có mặt ở hầu hết khắp các tỉnh có đồi gò, núi non ở Việt Nam[4]. Nhím cũng thường gặp trên các đảo gần bờ ở phía Đông Bắc Bộ. Vật mẫu của nhím đã sưu tầm được ở hầu hết các tỉnh: Quảng Ninh, Hà Bắc (cũ), Lạng Sơn, Cao Bằng, Bắc Thái, Hà Giang, Tuyên Quang, Vĩnh Phú (cũ), Yên Bái, Lào Cai, Lai Châu, Sơn La, Nghĩa Lộ, Hòa Bình, Hà Tây, Ninh Bình, Thanh Hoá, Nghệ An, Hà Tĩnh, Quảng Bình. Ở Nam Hà (cũ) cũng gặp nhím nhưng chỉ phát hiện ở gần đồi núi tiếp giáp với tỉnh Hòa Bình. Ngoài ra còn có ở Thừa Thiên Huế[2]', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Nh%C3%ADm_b%E1%BB%9Dm#:~:text=Nh%C3%ADm%20b%E1%BB%9Dm%20(Danh%20ph%C3%A1p%20khoa,Dao%20g%E1%BB%8Di%20l%C3%A0%20%C4%90i%E1%BB%81n%20d%E1%BA%A1y.'),
(4542, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Bandicota', NULL, 'GEN_0202', 'bandicotabengalensis', 'Bandicota bengalensis', 'Gray, 1835', 'Chuột đất bé', 'SPA_04586', 'Bộ lông của chúng có màu sẫm hoặc (hiếm khi) màu nâu nhạt ở mặt lưng , đôi khi hơi đen và ở phần bụng có màu xám nhạt đến đậm. Chiều dài từ đầu đến thân khoảng 250 mm, đuôi tối màu đồng nhất ngắn hơn chiều dài từ đầu đến thân.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Lesser_bandicoot_rat#/media/File:Lesser_Bandicoot-Rat.jpg'),
(4543, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Bandicota', NULL, 'GEN_0202', 'bandicotaindica', 'Bandicota indica', '(Bechstein, 1800)            ', 'Chuột đất lớn', 'SPA_04587', 'Nó có thể dài tới khoảng 27–29 cm nếu không bao gồm đuôi và đuôi có thể dài tới 28 cm. Chuột đất lớn hơn có phần trên màu nâu xám sẫm với rất nhiều lông dài màu đen. Hai bên có màu xám với một vài sợi lông dài màu đen. Lông ngắn, màu xám nhạt xuất hiện trên bề mặt bụng. Nó có một cái đuôi sẫm màu và trần trụi, có vảy, bàn chân sẫm màu với những móng vuốt màu sáng. Con non có màu nhạt hơn nhiều. Những con chuột bandicoot lớn, hung hãn dựng những sợi lông bảo vệ trên lưng và phát ra tiếng càu nhàu khi bị quấy rầy. Nếu bị nhốt cùng với những con bandicoot khác, nó có thể sẽ chiến đấu đến chết trong vòng vài giờ. Thông thường, chúng chiếm vùng ngoại ô nơi ở của con người như khu nhà và vườn và thường được tìm thấy gần thùng rác. Thói quen đào hang của chúng gây ra thiệt hại lớn cho mặt đất và sàn nhà, vì chúng cũng có thể đào hầm xuyên qua gạch và gạch xây. Những cái hang lớn đặc trưng của chúng cho thấy sự hiện diện của chúng. Chúng không phải là loài kén ăn, ăn rác thải sinh hoạt, ngũ cốc, rau củ và là loài gây hại rất nghiêm trọng ở các trang trại gia cầm. Chúng cũng là vật mang mầm bệnh cho nhiều bệnh tật. Một con cái có từ 8 đến 10 lứa. Những con non (8–14 con mỗi lứa) bị mù và trần truồng khi sinh ra. Con non đạt đến độ chín về tình dục vào khoảng 50 đến 60 ngày sau khi sinh. Tuổi thọ của người trưởng thành là khoảng một năm.', NULL, ' tìm thấy ở Trung Quốc, Ấn Độ, Indonesia, Lào, Malaysia, Myanmar, Nepal, Sri Lanka, Đài Loan, Thái Lan và Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'Thainationalparks'),
(4544, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Bandicota', NULL, 'GEN_0202', 'bandicotasavilei', 'Bandicota savilei', '(Thomas, 1916)', 'Chuột đất nhỏ', 'SPA_04588', 'Đầu thân 145-225 mm, đuôi 75-178 mm, tai 22-26 mm, chân sau 33-40 mm; trọng lượng 140-220 g. Đuôi ngắn, có 10-12 hàng vảy/cm2; xương lưng mềm và có màu nâu, nhạt hơn các loài khác; hộp sọ có kích thước trung bình; xương mũi dài, vượt quá răng cửa; bề mặt sau bên của vùng chẩm bị giảm đi nhiều Môi trường sống chủ yếu là nông nghiệp, gần các ngôi làng (đồng lúa và ngô), thường tránh môi trường sống ngập nước ', NULL, ' Myanmar, Thái Lan, Campuchia và Việt Nam; nó có thể xảy ra ở vùng đất thấp của Lào.', NULL, NULL, NULL, NULL, NULL, NULL, 'Treatment'),
(4545, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Berylmys', NULL, 'GEN_0219', 'berylmysberdmorei', 'Berylmys berdmorei', '(Blyth, 1851)', 'Chuột mốc bé', 'SPA_04589', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4546, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Berylmys', NULL, 'GEN_0219', 'berylmysbowersi', 'Berylmys bowersi', '(Anderson, 1879)', 'Chuột mốc lớn', 'SPA_04590', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4547, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Chiromyscus', NULL, 'GEN_0381', 'chiromyscuschiropus', 'Chiromyscus chiropus', '(Thomas, 1891)', 'Chuột nhắt cây', 'SPA_04591', 'Là loài chuột có kích thước trung bình. Chiều dài thân 138 - 160 mm, đuôi dài 200 - 233 mm, tai dài 19 - 20 mm, chân sau 27 - 29 mm. Lưng màu đất son nhạt gần xuống bụng, có một vùng trung gian màu cam và trải rộng lên ngực và vùng cằm. Bụng màu trắng kem, có vết cam trên đùi trong. Đuôi dài, đều màu nâu đậm. Râu mép dài, căng ra sau đầu. Tai nhỏ, tròn, màu nâu nhạt ở đỉnh. Vuốt dài và cong, ngón cái quẹo ra có móng thay vì vuốt. Sọ đầu thô và lồi khi nhìn ngang.', NULL, 'Loài này gặp ở các tỉnh Tây Nguyên, ở các Vườn quốc gia Cát Tiên, Bù Gia Mập, Núi Bà Đen, Tây Ninh và ở độ cao từ 400 m đến 1.000 m.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=22&loai=&ID=5999'),
(4548, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Chiromyscus', NULL, 'GEN_0381', 'chiromyscussp', 'Chiromyscus sp.', NULL, 'Chuột cây', 'SPA_04592', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4549, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Chiropodomys', NULL, 'GEN_0382', 'chiropodomysgliroides', 'Chiropodomys gliroides', '(Blyth, 1855)            ', 'Chuột nhắt cây đuôi dài', 'SPA_04593', 'Loài chuột nhỏ này có đặc điểm là chiếc đuôi tương đối dài, tương đương 135% chiều dài đầu-thân. Bộ lông mềm ở phần trên thay đổi từ màu nâu vàng nhạt đến màu xám nhạt, còn phần dưới có màu trắng. Đuôi thường có lông, kết thúc ở đầu giống như bàn chải. Đầu ngắn, mắt tương đối to, tai tròn và râu dài.', NULL, 'Loài này phân bố từ các vùng phía đông bắc Ấn Độ và miền nam Trung Quốc, qua Myanmar, Thái Lan, Lào, Campuchia và Việt Nam đến Bán đảo Malaysia, Sumatra, Java và Bali.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.ecologyasia.com/verts/mammals/pencil-tailed-tree-mouse.htm'),
(4550, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Hapalomys', NULL, 'GEN_0817', 'hapalomysdelacouri', 'Hapalomys delacouri', 'Thomas, 1927', 'Chuột marmoset nhỏ', 'SPA_04594', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4551, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Hapalomys', NULL, 'GEN_0817', 'hapalomyssuntsovi', 'Hapalomys suntsovi', 'Abramov & Balakirev & Rozhnov, 2017', 'Chuột marmoset Suntsov', 'SPA_04595', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4552, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Leopoldamys', NULL, 'GEN_1048', 'leopoldamysedwardsi', 'Leopoldamys edwadsi', '(Thomas, 1882)', 'Chuột hươu lớn', 'SPA_04596', 'Đầu thân 21 - 29 mm, đuôi 264 - 315 mm, tai 28 - 32 mm, chân sau 42 - 58 mm; trọng lượng 23 - 48 g. Chuột khổng lồ đuôi dài Edwards lớn và rất giống với Chuột khổng lồ đuôi dài Herbert (L. herberti) có màu sẫm hơn. Bộ xương ngắn, bóng mượt, mềm mại, có nhiều gai linh hoạt xen kẽ khắp cơ thể. Phần lưng có màu từ nâu đến nâu xám, có màu nâu đậm hơn ở phần sống lưng và nhạt hơn ở hai bên, với các lớp lông bảo vệ dài hơn xen lẫn khắp cơ thể. Venter có màu trắng kem và được phân định rõ ràng từ mặt lưng. Bàn chân dài và có màu nâu xám ở mặt lưng, có các chữ số màu trắng. Tai dài, mềm như cao su, trần trụi và có màu nâu sẫm; vibrissae dài. Đuôi dài (khoảng 116% chiều dài đầu-thân) và có hai màu không rõ ràng, có màu nâu sẫm ở trên và màu trắng kem ở dưới, đôi khi có đầu màu trắng. Có bốn cặp vú: một cặp ngực, một cặp nách và hai cặp bẹn', NULL, NULL, NULL, NULL, NULL, NULL, 'LC', NULL, 'https://www.gbif.org/species/2437925'),
(4553, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Leopoldamys', NULL, 'GEN_1048', 'leopoldamysrevertens', 'Leopoldamys revertens', '(H. C. Robinson & Kloss, 1919)', '  ', 'SPA_04597', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4554, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Leopoldamys', NULL, 'GEN_1048', 'leopoldamyssabanus', 'Leopoldamys sabanus', '(Thomas, 1887)', 'Chuột núi đuôi dài', 'SPA_04598', 'Chiều dài đầu-thân: lên tới 27 cm\nChiều dài đuôi: lên tới 41 cm\nTrọng lượng: lên tới 500 gmsBộ lông của nó ngắn, bóng và mượt. Màu sắc của nó thường là màu nâu sẫm ở lưng, mông và mõm, và màu nâu vàng ở hai bên sườn và một bên đầu (các dạng nhạt màu hơn xuất hiện ở xa đất liền). Bụng có màu trắng vàng đến trắng xỉn, có ranh giới màu rõ ràng giữa lông ở hai bên sườn và bụng. Phần phía trước của đuôi có màu sẫm ở trên và nhạt ở phía dưới, nhưng nửa sau thường có màu nhạt. Đuôi có vảy với lông ngắn. Nó chủ yếu sinh sống ở vùng đất thấp, đồi và rừng vùng núi thấp ở nhiều nơi ở Đông Nam Á, thường lên tới độ cao khoảng 1200 mét, mặc dù trong một số trường hợp cực đoan, nó đã được tìm thấy ở độ cao hơn nhiều. Loài này thích nghi với việc leo trèo và là loài bán sống trên cây - đôi khi nó có thể khám phá cao hơn vào tán rừng. Nó làm tổ trong các hốc cây và hang, ăn trái cây, thực vật và côn trùng.', NULL, ' phân bố ở miền đông Ấn Độ, Bangladesh, Myanmar, Thái Lan, Lào, Campuchia, Việt Nam, bán đảo Malaysia, Sumatra, Java và Borneo.', NULL, NULL, NULL, NULL, NULL, NULL, 'Ecologyasia'),
(4555, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Maxomys', NULL, 'GEN_1168', 'maxomysmoi', 'Maxomys moi', '(Robinson, Kloss, 1922)', 'Chuột su-ri lông mềm', 'SPA_04599', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4556, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Maxomys', NULL, 'GEN_1168', 'maxomyssurifer', 'Maxomys surifer', '(Miller, 1900)            ', 'Chuột xu-ri', 'SPA_04600', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4557, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Mus', NULL, 'GEN_1261', 'muscaroli', 'Mus caroli', 'Bonhote, 1902            ', 'Chuột nhắt nư­ơng', 'SPA_04601', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4558, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Mus', NULL, 'GEN_1261', 'muscookii', 'Mus cookii', 'Ryley, 1914', 'Chuột cúc', 'SPA_04602', 'Ghi chú mô tả. Đầu thân 77 - 96 mm, đuôi 83 - 91 mm, tai 15 mm, chân sau 19 - 5 mm; trọng lượng 16 - 5 - 23 g. Chuột Cook tương tự như Chuột Ryukyu (M. caroli), nhưng nó lớn hơn và không có đuôi hai màu. Bộ lông lưng có màu nâu xám sẫm và cứng; phần bụng có màu trắng xám. Đuôi ngắn hơn (9 - 1%) so với chiều dài đầu-thân và không có màu sắc. Con cái mang ba cặp vú.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.gbif.org/species/2438802'),
(4559, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Mus', NULL, 'GEN_1261', 'musmusculus', 'Mus musculus', 'Linnaeus. 1758            ', 'Chuột nhắt nhà.', 'SPA_04603', 'Chuột nhà có chiều dài cơ thể trưởng thành (từ mũi đến gốc đuôi) là 7,5–10 cm, và chiều dài đuôi là 5–10 cm. Trọng lượng thường là 40–45 g. Trong tự nhiên, chúng có nhiều màu sắc khác nhau từ xám, nâu nhạt đến đen (các sợi lông riêng lẻ thực sự có màu agouti ), nhưng chuột nhà và chuột thí nghiệm được thuần hóa có nhiều màu từ trắng đến màu sâm panh đến đen. Chúng có lông ngắn và một số, nhưng không phải tất cả, các loài phụ có bụng nhẹ. [4] Tai và đuôi có ít lông. Bàn chân sau ngắn chỉ  dài 15–19 mm  Chuột nhà phát triển mạnh trong nhiều điều kiện khác nhau; chúng được tìm thấy trong và xung quanh các ngôi nhà và công trình thương mại, cũng như trên các cánh đồng trống và đất nông nghiệp. Từ khoảng 10 ngày tuổi, con cái đã có năm cặp tuyến vú và núm vú ; con đực không có núm vú.  Khi trưởng thành về mặt sinh dục, sự khác biệt nổi bật và rõ ràng nhất là sự hiện diện của tinh hoàn trên con đực. Chúng lớn so với phần còn lại của cơ thể và có thể rút vào cơ thể.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Wikipedia'),
(4560, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Mus', NULL, 'GEN_1261', 'musoaroli', 'Mus oaroli', 'Bonhote, 1902', 'Chuột nhắt đồng', 'SPA_04604', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4561, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Mus', NULL, 'GEN_1261', 'muspahari', 'Mus pahari', 'Thomas,1916             ', 'Chuột nhắt nư­ơng', 'SPA_04605', 'Đầu thân 75 - 105 mm, đuôi 70 - 100 mm, tai 14 mm, chân sau 19 - 22 mm; trọng lượng 20 - 28 g. Một con chuột lớn giống chuột chù với chiếc mũi tương đối dài và đôi mắt nhỏ. Lông có gai. Phần lưng có lông màu xám đen đến xám nâu, phần dưới màu trắng. Đuôi bằng hoặc nhỏ hơn một chút (90 - 100%) so với chiều dài đầu-thân. Trên hộp sọ, lỗ vòm miệng trước ngắn.  sống. Đồng cỏ trong rừng núi và có thể là rừng thứ sinh, ở độ cao tới 2000 m so với mực nước biển. Nó tận dụng các kẽ hở trong đất và làm tổ hình cầu bằng cỏ khô hoặc trong ống tre. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Gbif.org'),
(4562, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Mus', NULL, 'GEN_1261', 'musshortridgei', 'Mus shortidjei', '(Thomas, 1914)', 'Chuột nhắt', 'SPA_04606', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4563, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Niniventer', NULL, 'GEN_1325', 'niniventerfulvescens', 'Niniventer fulvescens', '(Gray, 1847)', 'Chuột hư­ơu bé', 'SPA_04607', ' Đầu thân 131 - 172 mm, đuôi 160 - 221 mm, tai 20 - 23 mm, chân sau 28 - 32 mm; trọng lượng 60 - 135 g. Lưng có màu đỏ hồng ngọc sáng, có sọc màu nâu đậm hoặc sọc hạt dẻ ở phần lưng của bàn chân, gần như dài tới các ngón tay màu trắng, dày và sẫm màu hơn chuột bụng trắng Nam Trung Quốc. Không có vết rỗ ở ngực hoặc cằm. Tai có màu nâu sẫm;  Môi trường sống. Rừng lá rộng thường xanh, cây bụi, đá và gần nước từ mực nước biển đến độ cao ¢. 2600 m. ăn hạt, quả mọng, côn trùng và có thể cả thảm thực vật xanh.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Gbif'),
(4564, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Niviventer', NULL, 'GEN_1330', 'niviventerbukit', 'Niviventer bukit', '(Bonhote, 1903)', 'Chuột bukít', 'SPA_04608', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4565, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Niviventer', NULL, 'GEN_1330', 'niviventerconfucianus', 'Niviventer confucianus', '(Milne-Edwards, 1871)', 'Chuột khổng tử', 'SPA_04609', 'Ghi chú mô tả. Đầu thân 116 - 173 mm, đuôi 194 - 269 mm, tai 22 - 28 mm, chân sau 31 - 4 mm; trọng lượng 43 - 124 g. Chuột bụng trắng Nho giáo có kích thước lớn và khá đa dạng, với bộ lông dài mềm và đôi khi có gai linh hoạt và các sợi lông bảo vệ màu đen xen lẫn khắp cơ thể. Phần lưng có màu nâu sô-cô-la đậm đến màu nâu đỏ quế sáng hơn và thường sáng bóng, sẫm màu nhất ở gần giữa lưng và trở thành màu quế đỏ nhạt hơn ở hai bên. Bụng có màu trắng kem đến hơi vàng kem, đôi khi hơi vàng hơn ở xung quanh chân trước hoặc chân sau và được phân định rõ ràng từ mặt lưng. Một số mẫu vật có đốm nhỏ màu nâu nhạt trên ngực. Đuôi dài 125 - 135 % chiều dài từ đầu đến thân, được bao phủ bởi những sợi lông mỏng màu trắng hoặc màu kem, trở nên rậm hơn ở gần chóp và có hai màu rõ rệt, phía trên có màu nâu nhạt đến trung bình, thuôn nhọn ở gần cuối tạo thành đuôi màu trắng và màu kem đến nâu rất nhạt. dưới', NULL, NULL, NULL, NULL, NULL, NULL, 'LC', NULL, 'https://www.gbif.org/species/2439057'),
(4566, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Niviventer', NULL, 'GEN_1330', 'niviventercremoriventer', 'Niviventer cremoriventer', '(Miller, 1900)', 'Chuột bụng kẽm', 'SPA_04610', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4567, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Niviventer', NULL, 'GEN_1330', 'niviventerfulvescens', 'Niviventer fulvescens', '(Gray, 1847)', 'Chuột hươu bé', 'SPA_04611', 'Nó là một loài gặm nhấm nhỏ có lớp lông trên màu hạt dẻ sáng rõ rệt và lớp lông dưới màu trắng. Màu sắc của lớp lông trên có thể thay đổi từ rất sáng đến nâu xỉn hơn. Một bên của cơ thể có một đường viền rõ ràng, nơi gặp nhau của lớp lông trên và lớp lông dưới. Mặt trên của đuôi chủ yếu có màu nâu trong khi mặt dưới có màu từ trắng đến thịt', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4568, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Niviventer', NULL, 'GEN_1330', 'niviventerhuang', 'Niviventer huang', 'Bonhote, 1905', 'Chuột hươu bé', 'SPA_04612', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4569, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Niviventer', NULL, 'GEN_1330', 'niviventerniviventer', 'Niviventer niviventer', '(Hodgson, 1836)', 'Chuột bụng trắng', 'SPA_04613', 'Ghi chú mô tả. Đầu thân 133 - 16 mm, đuôi ¢. trung bình là 212 mm. Không có dữ liệu cụ thể về trọng lượng cơ thể. Chuột bụng trắng Himalaya có kích thước nhỏ và tương đối sống động. Pelage mềm. Phần lưng có màu đỏ ruby, đôi khi có màu rỉ sét (bộ lông kém sáng hơn ở chuột bụng trắng Đông Dương, N. fulvescens). Venter có màu trắng tinh, không có sắc vàng, nhưng một số mẫu vật có đốm màu nâu hoặc nâu vàng trên ngực hoặc cổ. Đuôi là ¢. 145 % chiều dài từ đầu đến thân, cứng và có hai màu, mặt trên màu nâu và mặt dưới nhạt màu hơn, đầu hoàn toàn không có màu. Phần ngọn của bàn chân trước và bàn chân sau có sọc nâu chạy dọc ở giữa; các ngón tay và hai bên bàn chân có màu trắng. Tai có màu nâu sẫm; vibrissae dài. Có năm ngón trên mỗi bàn chân, với ngón thứ năm giảm bớt bằng móng vuốt nhỏ. Hộp sọ nhỏ, không có gờ xương nổi bật, thon dài, hẹp và rộng hơn hộp sọ của Chuột bụng trắng Đông Dương và Chuột bụng trắng Nam Trung Quốc (N. huang). Có bốn cặp vú: một ở ngực, một ở sau nách, một ở bụng và một ở bẹn.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.gbif.org/species/2439056'),
(4570, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Niviventer', NULL, 'GEN_1330', 'niviventersp', 'Niviventer sp', NULL, 'Chuột', 'SPA_04614', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4571, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Niviventer', NULL, 'GEN_1330', 'niviventertenaster', 'Niviventer tenaster', '(Thomas, 1916)', 'Chuột núi đông dương', 'SPA_04615', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4572, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattusandamanensis', 'Rattus andamanensis', '(Blyth, 1860)', 'Chuột rừng đông dương', 'SPA_04616', 'Ghi chú mô tả. Đầu - thân 155 - 200 mm, đuôi 185 - 240 mm, tai 23 - 25 mm, chân sau 32 - 37 mm; trọng lượng 100 - 150 g. Chuột rừng Đông Dương có kích thước vừa phải và hơi giống với Chuột mái nhà (R. rattus), với nhiều miếng đệm chân hơn, đuôi dài hơn tương ứng và các sợi lông bảo vệ dài hơn. Bộ lông dài và dày, có các sợi lông bảo vệ màu đen nổi bật (nổi bật hơn dọc theo đường giữa lưng). Phần lưng có nhiều sắc thái khác nhau của màu nâu, với màu cam, các sợi lông màu nâu nhạt và có đầu đen và các sợi bảo vệ xen lẫn khắp cơ thể. Một mẫu vật từ Hồng Kông có các mảng trắng trên mõm và má, điều này đã được ghi nhận ở các mẫu vật khác. Venter có màu trắng kem, và một số cá thể có những đốm lông màu xám hoặc mảng ngực màu nâu đỏ; xương bụng được phân chia rõ ràng với xương lưng. Bàn chân được bao phủ bởi sự kết hợp của các sợi lông sáng và tối ở mặt lưng, cho đến các ngón có màu trắng. Tai tương đối lớn và có màu sắc giống với xương lưng; vibrissae đặc biệt dài và dày. Đuôi là ¢. 120% chiều dài từ đầu đến thân và nhìn chung có màu nâu ở mặt lưng và bụng, mặc dù một số cá thể được báo cáo ở Hải Nam có đuôi màu trắng. Hộp sọ khỏe mạnh, có mõm tương đối rộng và các bóng nước nhỏ. Một số loài ve (Laelaps nuttali, L. echidninus, Lyponissoides, Ornithonyssus bacoti) và bọ chét (Xenopsylla cheopis) đã được ghi nhận trên Chuột rừng Đông Dương. Có sáu cặp vú: ba cặp nách và ba cặp bẹn. Bộ nhiễm sắc thể bổ sung là 2 n = 42, FN = 64 và 70.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.gbif.org/species/4264920'),
(4573, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattusargentiventer', 'Rattus argentiventer', 'Robinson & Kloss', 'Chuột bụng bạc', 'SPA_04617', 'loài chuột cỡ trung bình có bộ lông màu nâu vàng và đen hoa râm, không có gai khi vuốt ve. Bụng của nó có màu xám ở giữa với hai bên sườn trắng hơn. Mặt lưng của bàn chân sau có màu giống với lưng và thường có một đốm hoặc đường sẫm màu. Đuôi có màu nâu vừa đều. loài động dục đa dạng với thời gian động dục kéo dài 4 đến 5 ngày và mùa sinh sản liên tục. Quá trình mang thai kéo dài 3 tuần, với 3 đến 8 con mỗi lứa và 1 đến 12 lứa một năm. Chuột đồng có 12 con. Chuột cái xây tổ từ 3 đến 5 ngày trước khi sinh con và con non được sinh ra. Chúng sinh ra trần truồng và mù lòa nhưng có đầy đủ lông. Sau 15 ngày, mắt họ mở ra. Quá trình cai sữa xảy ra và con non rời tổ sau 3 tuần. sống thành từng nhóm lớn với hệ thống phân cấp xã hội gồm những con đực thống trị và một số con cái có thứ hạng cao. Các nhóm có tính lãnh thổ. loài ăn tạp , với chế độ ăn bao gồm mối, châu chấu, ốc sên, côn trùng, gạo, hạt, quả hạch, rau và trái cây. cư trú ở các khu vực canh tác như cánh đồng lúa và đồng cỏ. Nó chủ yếu phụ thuộc vào ruộng lúa và đồn điền của con người. Chuột đồng lúa trú ẩn trong các hang dưới đất, dưới đá và trong khúc gỗ. Chúng làm tổ từ những đống vật liệu rỗng, thường là trong hang.', NULL, ' khắp Đông Nam Á.', NULL, NULL, NULL, NULL, NULL, NULL, 'animaldiversity'),
