(4576, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattusbukit', 'Rattus bukit', 'Robinson & Kloss, 1919', 'Chuột Bukit', 'SPA_04620', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4577, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattuscremoriventer', 'Rattus cremoriventer', 'Bartels, 1937', 'Chuột bụng kem', 'SPA_04621', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4578, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattusedwardsi', 'Rattus edwardsi', '(Thomas, 1882)', 'Chuột hươu lớn', 'SPA_04622', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4579, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattusexulans', 'Rattus exulans', '(Peale, 1884)', 'Chuột lắt', 'SPA_04623', 'Nó có tai to, tròn, mõm nhọn, bộ lông nâu/đen với phần bụng nhạt màu, bàn chân khá nhỏ. Cơ thể nó ôm, dài, đạt chiều dài 6 in (15 cm) từ mũi đến gốc đuôi, hơi nhỏ hơn những loài chuột khác thường sống gần người.  sống ở nhiều môi trường, từ đồng cỏ tới rừng rậm. Nó cũng hay có mặt tại chỗ ở con người, nơi chúng có thể dễ dàng kiếm ra thức ăn. Nó là một loài gây hại trên hầu hết phạm vi phân bố.', NULL, ' Chuột lắt bắt nguồn từ Đông Nam Á, và, giống những loài tương tự, lan rộng ra hầu hết đảo Polynesia, gồm New Zealand, đảo Phục Sinh, và Hawaii.', NULL, NULL, NULL, NULL, NULL, NULL, 'wikipedia'),
