(4583, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattuslosea', 'Rattus losea', '(Swinhoe, 1871)', 'Chuột đồng bé', 'SPA_04627', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4584, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattusmolliculus', 'Rattus molliculus', '(Robinson et Kloss, 1922)', 'Chuột đàn', 'SPA_04628', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4585, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattusnitidus', 'Rattus nitidus', '(Hodgson, 1845)            ', 'Chuột bóng', 'SPA_04629', 'Chiều dài đầu và thân là 160 đến 180 mm (6 đến 7 in). Nó có bộ lông lưng màu nâu mềm và phần dưới màu trắng, mỗi sợi lông có phần gốc màu xám. Bàn chân màu trắng, bàn chân sau hẹp hơn so với bàn chân của R. nâu và lòng bàn chân có những đường gờ giúp tăng thêm độ bám khi con vật leo trèo Nó thường sinh sống ở cả rừng nguyên sinh và rừng thứ sinh ở độ cao lên tới khoảng 2.750 m (9.000 ft), nhưng là loài có khả năng thích nghi và cũng được tìm thấy trong các đồn điền, trên đất nông nghiệp và xung quanh nhà ở của con người', NULL, ' được tìm thấy ở Ấn Độ, Bangladesh, Nepal, Bhutan, Trung Quốc, Myanmar, Lào, Thái Lan và Việt Nam, với các quần thể du nhập ở Indonesia (rộng rãi), Palau và Philippines', NULL, NULL, NULL, NULL, NULL, NULL, 'Wikipedia'),
(4586, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattusniviventes', 'Rattus niviventes', '(Hodgson, 1836)', 'Chuột bụng trắng', 'SPA_04630', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4587, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattusnorvegicus', 'Rattus norvegicus', '(Berkenhout, 1769)            ', 'Chuột cống', 'SPA_04631', 'Chuột nâu là một trong những loài chuột lớn nhất, nó có màu nâu hoặc màu xám với chiều dài cơ thể 25 cm, và một cái đuôi dài tương tự, con đực nặng trung bình 350 g còn con cái nặng 250 g', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4588, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattusrattus', 'Rattus rattus', '(Linnaeus, 1758)', 'Chuột thường', 'SPA_04632', 'có chiều dài 32,4-46,4 cm, bao gồm đuôi dài 17–25 cm và can nặng 110-340 g[2]. Mặc dù có tên gọi là chuột đen, loài này lại có một số hình thức màu sắc khác. Nó thường là màu đen đến nâu sáng với phía dười màu nhạt hơn', NULL, 'Loài chuột này có nguồn gốc ở vùng nhiệt đới châu Á và lây lan qua vùng Cận Đông trong thời La Mã trước khi tới châu Âu vào thế kỷ 1 và lây lan với châu Âu trên toàn thế giới', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Chu%E1%BB%99t_%C4%91en'),
(4589, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattusremotus', 'Rattus remotus', '(Robinson & Kloss, 1914)', 'Chuột rừng', 'SPA_04633', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4590, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattussabanus', 'Rattus sabanus', '(Thomas, 1887)', 'Chuột núi', 'SPA_04634', 'Bộ lông của nó ngắn, bóng và mượt. Màu sắc của nó thường là màu nâu sẫm ở lưng, mông và mõm, và màu nâu vàng ở hai bên sườn và một bên đầu (các dạng nhạt màu hơn xuất hiện ở xa đất liền). Bụng có màu trắng vàng đến trắng xỉn, có ranh giới màu rõ ràng giữa lông ở hai bên sườn và bụng.\n\nPhần phía trước của đuôi có màu sẫm ở trên và nhạt ở phía dưới, nhưng nửa sau thường có màu nhạt. Đuôi có vảy với lông ngắn.\n', NULL, 'Đây là loài phổ biến nhất trong số 6 loài chuột khổng lồ đuôi dài tạo nên chi Leopoldamys . Nó chủ yếu sinh sống ở vùng đất thấp, đồi và rừng vùng núi thấp ở nhiều nơi ở Đông Nam Á', NULL, NULL, NULL, NULL, NULL, NULL, 'ecologyasia.com'),
(4591, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattussladeni', 'Rattus sladeni', 'Hinton, 1919', 'Chuột rừng', 'SPA_04635', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
