(4593, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattussp2', 'Rattus sp2.', NULL, 'Chuột', 'SPA_04637', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4594, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattussp3', 'Rattus sp3.', NULL, 'Chuột', 'SPA_04638', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4595, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattussurifer', 'Rattus surifer', NULL, 'Chuột xuri', 'SPA_04639', 'Với chiều dài từ đầu đến thân lên tới 21 cm. bộ lông lưng màu nâu cam hoặc nâu đỏ đậm, tương phản với phần bụng màu vàng nhạt đến trắng. Ranh giới giữa lông lưng và lông bụng rất rõ ràng. Các gai ngắn và cứng xuất hiện ở cả lông lưng và lông bụng. Thường có một chiếc vòng cổ màu nâu cam dưới cổ, một đặc điểm không bao giờ có ở loài chuột này là quan hệ gần gũi. Đuôi có màu tối ở trên và nhạt ở dưới và không có nhiều lông. Mõm dài và nhọn, các chi ngắn. Bàn chân sau dài và thon. Loài chuột đẹp trai này xuất hiện ở rừng thứ sinh nguyên sinh và trưởng thành cũng như các khu vực canh tác hoặc phát quang liền kề. Nó không xảy ra ở những môi trường sống bị suy thoái nặng nề hoặc ở những đồn điền cọ dầu quy mô lớn. Nó sống về đêm và chủ yếu sống trên cạn. Loài này được biết đến là loài ăn tạp, ăn trái cây rụng và các thực vật khác, cũng như côn trùng và động vật không xương sống khác.', NULL, ' miền nam Trung Quốc, Myanmar, Thái Lan, Đông Dương và bán đảo Malaysia (bao gồm các đảo nhỏ hơn, lân cận). Ngoài khơi phạm vi của nó kéo dài đến Sumatra, Java và Borneo. Nó được cho là đã tuyệt chủng ở Singapore.', NULL, NULL, NULL, NULL, NULL, NULL, 'Ecologyasia'),
(4596, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Rattus', NULL, 'GEN_1717', 'rattustanezumi', 'Rattus tanezumi', 'Temminck, 1844            ', 'Chuột nhà', 'SPA_04640', 'Lông ở mặt lưng có màu nâu ô liu và mặt bụng thường nhạt màu hơn. Đuôi có màu xám đen và gần như trần trụi. Đôi tai to và đôi mắt đen tuyền. Con non có đầu tương đối lớn hơn và cơ thể nhỏ hơn. Là loài có khả năng thích nghi cực kỳ cao. tìm thấy ở nhiều môi trường sống nhân tạo bao gồm cả khu vực nông nghiệp và đô thị. Nó là loài ăn tạp, ăn tất cả các loại chất thải từ trang trại và thức ăn thừa. Nó là loài chạy nhanh, có khả năng leo trèo tốt và có thể nhảy cao tới 50 cm.', NULL, ' khắp Đông Nam Á.', NULL, NULL, NULL, NULL, NULL, NULL, 'ecologyasia'),
(4597, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Muridae', 'Chuột', 'FAM_251', 'Vandeleuria', NULL, 'GEN_2025', 'vandeleuriaoleracea', 'Vandeleuria oleracea', '(Bennet, 1832)            ', 'Chuột nhắt cây đuôi dài', 'SPA_04641', 'Chiều dài đầu và thân là 7–9 cm. Đuôi dài 1–12 cm. Phần trên màu nâu đỏ chuyển sang màu nâu vàng nhạt ở hai bên. Phần dưới có màu trắng nâu nhạt. Đuôi dài có màu sẫm và thon, không có búi ở chóp. Bàn chân sau to có móng thay vì móng vuốt ở các ngón chân bên ngoài, đối lập nhau', NULL, 'à một loài gặm nhấm được tìm thấy ở Nam và Đông Nam Á . [1] Nó được người Sinhalese gọi là Sinhala ', NULL, NULL, NULL, NULL, 'LC', NULL, 'https://en.wikipedia.org/wiki/Asiatic_long-tailed_climbing_mouse'),
(4598, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Platacanthomyidae', 'Chuột Gai', 'FAM_290', 'Typhlomys', NULL, 'GEN_2007', 'typhlomyscinereus', 'Typhlomys cinereus', 'Milne-Edwards, 1877', 'Chuột mù', 'SPA_04642', 'Trên mặt lưng màu nâu thẫm gần như đồng màu. Chúng có màu xám ở mặt bụng từ cằm đến hậu môn và mặt trong tay chân từ cổ đến tay, và đầu gối. Lông màu nâu hơi đen phủ mu bàn tay, bàn chân. Tai nhỏ gần như không có lông. Đuôi chúng dài hơn thân, lông ở gốc đuôi thua, màu nâu, chóp đuôi có túm lông thường màu trắng', NULL, 'Loài này phân bố ở Trung Quốc, ở Việt Nam chỉ có ở Lào Cai.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Chu%E1%BB%99t_m%C3%B9#:~:text=Typhlomys%20cinereus%20(t%C3%AAn%20ti%E1%BA%BFng%20Anh,Edwards%20m%C3%B4%20t%E1%BA%A3%20n%C4%83m%201877.&text=Chu%E1%BB%99t%20m%C3%B9%20nh%E1%BB%8F%20b%E1%BA%B1ng%20chu%E1%BB%99t,th%E1%BA%ABm%20g%E1%BA%A7n%20nh%C6%B0%20%C4%91%E1%BB%93ng%20m%C3%A0u.'),
(4599, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Pteromyidae', 'Sóc Bay', 'FAM_307', 'Belomys', NULL, 'GEN_0217', 'belomyspearsoni', 'Belomys pearsoni', 'Gray, 1842', 'Sóc bay lông tai', 'SPA_04643', 'Sau gốc tai có túm lông dài đen xám. Lưng xám nâu có đốm sẫm và nâu sáng. Trên màng da lượn và mặt ngoài các chi màu nâu hung chuyển sang xám đen. Mặt dưới màng da lượn và mặt trong chi màu nâu gỉ sắt nhạt. Đuôi xù, mút đuôi có túm lông nâu hung. Thức ăn chủ yếu là quả cây rừng và ít chồi lá. Chưa biết về sinh sản. Sóc bay lông tai sống trong rừng nhiệt đới cây to có độ che phủ lớn ở núi đá hoặc núi đất ít người qua lại. Hoạt động kiếm ăn về đêm, đi ăn từ 18 - 19 giờ đến mờ sáng hôm sau. Ngày mưa đôi khi gặp kiếm ăn ban ngày trên cây cao trong rừng vắng người.', NULL, 'Trong nước: Hà Giang, Lai Châu, Hoà Bình, Lào Cai, Yên Bái, Lạng Sơn, Thanh Hoá, Nghệ An, Kontum, Gia Lai, Đắk Lắk, Lâm Đồng, Đồng Nai, Côn Đảo, Phú Quốc. Thế giới: Ấn Độ, Nêpan, Mianma, Thái Lan, Nam Trung Quốc, Lào, Cămpuchia.', NULL, NULL, 'Loài thú kỳ lạ, hiếm của rừng nhiệt đới, được thế giới quan tâm bảo vệ. Có giá trị nghiên cứu khoa học và thẩm mỹ.', 'CR', 'DD', NULL, 'VnCreature'),
(4600, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Pteromyidae', 'Sóc Bay', 'FAM_307', 'Hylopetes', NULL, 'GEN_0927', 'hylopetesalboniger', 'Hylopetes alboniger', '(Hodgson, 1836)', 'Sóc bay đen trắng', 'SPA_04644', 'Cỡ nhỏ. Lông ở lưng gốc màu xám, đầu mút lông trắng nhạt. Má và bụng màu trắng nhạt hay trắng kem. Lông trên màng cánh màu nâu sẫm. Đuôi xù màu nâu sẫm. Mặt dưới đuôi có một đường trắng nhạt ở giữa. Thường sống ở rừng già, cả rừng hỗn giao trên núi cao, đặc biệt ưa thích sống ở rừng cây giẻ, sồi (Quercus). Làm tổ trong các hốc cây cao. Sóc bay đen trắng có thể đẻ 1 - 3 con vào mùa khô. Tuy nhiên sự hiểu biết về sinh học của loài sóc này còn ít.', NULL, 'Lai Châu, Lạng Sơn, Thừa Thiên - Huế, Kontum, Gia Lai, Lâm Đồng. Những năm gần đây ghi nhận cả ở Cao Bằng (Pia Oắc), Lạng Sơn (Hữu Liên). Nêpan, Mianma, Nam Trung Quốc, Thái Lan, Lào.', NULL, NULL, 'Là loài thú hiếm, kỳ lạ của rừng nhiệt đới. Có ý nghĩa khoa học, du lịch. Giữ được nguồn gen, nhân giống sẽ có giá trị xuất khẩu.', 'VU', NULL, NULL, 'vncreatures.net'),
(4601, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Pteromyidae', 'Sóc Bay', 'FAM_307', 'Hylopetes', NULL, 'GEN_0927', 'hylopetesphayrei', 'Hylopetes phayrei', 'Blyth, 1859', 'Sóc bay xám', 'SPA_04645', 'Sau tai hơi trắng. Đầu và lưng có màu từ xám đến nâu tuỳ thuộc vào đầu mút lông trắng nhạt hay nâu. Bụng trắng nhạt hoặc xám nhạt hoặc nâu xám. Mặt dưới đuôi bẹt, mặt trên hơi bẹt. Đuôi xám đậm hoặc nâu xám hoặc pha trộn với màu hơi nâu ở gốc và dọc hai bên đuôi. Sóc bay nhỏ sống trong rừng già, cây to trên núi cao dưới 1000m ít người qua lại. Làm tổ trong bọng cây to. Ban ngày nằm trong tổ, ban đêm đi kiếm ăn. Còn ít biết về sinh học.', NULL, 'Trong nước: Sơn La, Hoà Bình, Kontum, Gia Lai, Đắk Lắk, Lâm Đồng. Thế giới: Mianma, Thái Lan, Lào, Cămpuchia.', NULL, NULL, 'Loài thú hiếm gặp, kỳ lạ của rừng nhiệt đới, được thế giới chú ý bảo vệ. Nếu nuôi nhân giống có thể xuất khẩu.', 'VU', NULL, NULL, 'VnCreature'),
(4602, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Pteromyidae', 'Sóc Bay', 'FAM_307', 'Hylopetes', NULL, 'GEN_0927', 'hylopetesspadiceus', 'Hylopetes spadiceus', '(Blyth, 1847)', 'Sóc bay bé', 'SPA_04646', 'Dài đầu và dài thân 15,7 - 18,4cm, dài đuôi 15,2 - 16,6cm, dài bàn chân 29 - 35mm (11 mẫu). Trọng lượng 80 - 157 gram. Hộp sọ dài 31,4 - 36,4mm, ngang hốc mắt 7,8 - 8,7mm, dài hàng răng hàm trên 6,8 - 7,6mm (5 mẫu). Phần thân trên có màu đen nhạt hoặc màu nâu xám đậm, với những vết màu gỉ sét, đặc biệt ở đường kẻ giữa; phần thân dưới màu trắng, phần chân lông màu xám với sắc cam nhẹ. Màng cánh có rìa, mỏng màu trắng, Đuôi màu sậm, nâu cam nhạt với phần dưới lông màu da bò; chân lông có màu cam rõ rệt. Má màu nâu cam. Loài ăn đêm, sống trong tổ có bề rộng khoảng 32cm, theo ghi nhận cách mặt đất từ 0,3 - 3,3m (ở bán đảo Malaysia). Sống và kiếm ăn chủ yếu trong rừng cây gỗ lớn và rừng tái sinh.', NULL, 'Kontum, Gia Lai, Đắk Lắk, Lâm Đồng, Đồng Nai, Côn Đảo, Phú Quốc. Miến Điện, Thái Lan, phía Nam Indonesia, bán đảo Mã Lai, Sumatra, Java. Borneo', NULL, NULL, 'Loài thú kỳ lạ, hiếm của rừng nhiệt đới, được thế giới quan tâm bảo vệ. Có giá trị nghiên cứu khoa học và thẩm mỹ.', NULL, NULL, NULL, 'vncreatures.net'),
(4603, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Pteromyidae', 'Sóc Bay', 'FAM_307', 'Petaurista', NULL, 'GEN_1509', 'petauristaelegans', 'Petaurista elegans', '(Müller, 1840)            ', 'Sóc bay sao', 'SPA_04647', 'Sóc bay cỡ trung bình. Tai màu nâu sẫm, phần dưới tai màu hung đen. Đầu và lưng màu nâu hay nâu hung đỏ với những vết đốm sáng không đều rải rác. Màng cánh da có lông nâu vàng trên nền đen, nền có màu lốm đốm hay vằn. ở dưới màng da có những vết màu trắng nhỏ không đều rải rác.', NULL, 'Trong nước: Lai Châu, Sơn La, Lào Cai, Hà Giang, Kontum, Lâm Đồng', NULL, NULL, NULL, NULL, 'EN', NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5597'),
(4604, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Pteromyidae', 'Sóc Bay', 'FAM_307', 'Petaurista', NULL, 'GEN_1509', 'petauristapetaurista', 'Petaurista petaurista', '(Pallas, 1766)', 'Sóc bay trâu', 'SPA_04648', 'Sóc bay cỡ lớn nhất trong các loài sóc bay. Màng da hai bên sườn nối liền cổ, chi trước, chi sau và gốc đuôi. Bộ lông dầy, mềm. Lông ở đầu, lưng, đuôi và mặt trên của màng da có gốc xám thẫm, một phần ba phần đầu mút lông nâu hung tạo nên nền mầu của lưng có mầu nâu hung, đầu mút lông phớt trắng làm cho lưng có mầu nâu hung lốm đốm trắng. Mặt có nhiều đốm trắng. Cằm xám đến nâu sáng. Bụng, mắt dưới màng da nâu hung nhạt. Bàn chân màu đen. Đuôi tròn, xù và dài hơn dài thân.\n Sống trong rừng già nhiều cây gỗ lớn và có quả trên núi đá, núi đất. Làm tổ trong các bọng cây to, cao giữa tán lá cành rậm rạp. Sóc sống đơn độc, chỉ ghép đôi vào mùa động dục. Tuy vậy, có thể gặp 3 - 4 sóc cùng ăn trên một cây. Hoạt động kiếm ăn ban đêm, di chuyển chậm dọc theo các cành cây; chúng có thể dương màng da bay lượn từ cây này sang cây khác với khoảng cách khá xa. Sóc bay trâu ăn quả, hạt (dẻ rừng, sấu, sung, vả, si, đa, trám trắng, trám đen), chồi non, lá cây non. Đẻ mỗi năm hai lứa vào tháng 4 - 5 và tháng 8 - 9. Mỗi lứa đẻ 1-2 con hoặc 3 - 4 con. Con non được nuôi trong tổ cho đến khi sống tự lập.', NULL, 'từ Bắc vào Nam nơi các khu vực rừng còn được bảo vệ tốt. Thế giới: Pakixtan, Apganixtan, Ấn Độ, Xri Lanka, Nêpan, Mianma, Malaixia, Thái Lan, Nam Trung Quốc, Lào, Cambodia.', NULL, NULL, 'Thú quý, kỳ lạ, có ý nghĩa khoa học, Bộ lông đẹp có thể nuôi nhân giống, xuất khẩu.', 'VU', NULL, NULL, 'Vncreatures'),
(4605, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Pteromyidae', 'Sóc Bay', 'FAM_307', 'Petaurista', NULL, 'GEN_1509', 'petauristaphilippensis', 'Petaurista philippensis', '(Elliot, 1839)            ', 'Sóc bay trâu', 'SPA_04649', 'Sóc bay cỡ lớn nhất trong các loài sóc bay. Màng da hai bên sườn nối liền cổ, chi trước, chi sau và gốc đuôi. Bộ lông dầy, mềm. Lông ở đầu, lưng, đuôi và mặt trên của màng da có gốc xám thẫm, một phần ba phần đầu mút lông nâu hung tạo nên nền mầu của lưng có mầu nâu hung, đầu mút lông phớt trắng làm cho lưng có mầu nâu hung lốm đốm trắng. Mặt có nhiều đốm trắng. Cằm xám đến nâu sáng. Bụng, mắt dưới màng da nâu hung nhạt. Bàn chân màu đen. Đuôi tròn, xù và dài hơn dài thân.\n Sống trong rừng già nhiều cây gỗ lớn và có quả trên núi đá, núi đất. Làm tổ trong các bọng cây to, cao giữa tán lá cành rậm rạp. Sóc sống đơn độc, chỉ ghép đôi vào mùa động dục. Tuy vậy, có thể gặp 3 - 4 sóc cùng ăn trên một cây. Hoạt động kiếm ăn ban đêm, di chuyển chậm dọc theo các cành cây; chúng có thể dương màng da bay lượn từ cây này sang cây khác với khoảng cách khá xa. Sóc bay trâu ăn quả, hạt (dẻ rừng, sấu, sung, vả, si, đa, trám trắng, trám đen), chồi non, lá cây non. Đẻ mỗi năm hai lứa vào tháng 4 - 5 và tháng 8 - 9. Mỗi lứa đẻ 1-2 con hoặc 3 - 4 con. Con non được nuôi trong tổ cho đến khi sống tự lập.', NULL, 'từ Bắc vào Nam nơi các khu vực rừng còn được bảo vệ tốt. Thế giới: Pakixtan, Apganixtan, Ấn Độ, Xri Lanka, Nêpan, Mianma, Malaixia, Thái Lan, Nam Trung Quốc, Lào, Cambodia.', NULL, NULL, 'Thú quý, kỳ lạ, có ý nghĩa khoa học, Bộ lông đẹp có thể nuôi nhân giống, xuất khẩu.', 'VU', NULL, NULL, 'Vncreatures'),
(4606, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Sciuridae', 'Sóc Cây', 'FAM_334', 'Callosciurus', NULL, 'GEN_0289', 'callosciuruserythraeus', 'Callosciurus erythraeus', '(Pallas, 1779)            ', 'Sóc bụng đỏ', 'SPA_04650', 'Sóc bụng đỏ nặng 0,2 - 0,3 kg, dài thân 200 - 260mm, dài đuôi 200mm. Thân hình trụ dài, kích thước cơ thể trung bình, các cá thể trong 2 phân loài thuộc loài này ở Việt Nam có màu sắc bộ lông khá khác nhau. Cả hai phân loài Callosciurus erythraeus erythraeus phân bố ở phía Bắc Callosciurus erythraeus flavimantus phân bố ở phía Nam đều có phần lưng màu phớt xanh ô liu và bụng thường có màu phớt đỏ. Chân của loài Callosciurus erythraeus flavimantus có màu nhạt hơn màu ở phần bụng và mõm có màu nhạt hơn màu phần lưng Loài này thường dống ở trên cây trong các khu rừng thường xanh và hỗn giao rụng lá dưới chân núi cho đến các vùng đồng bằng. Kể cả các vùng rừng đã bị tác động mạnh. Thức ăn của loài này là các loài quả cây có trong sinh cảnh sống của chúng. Làm tổ trong các hốc cây, mỗi lứa đẻ từ 2 - 4 con, con non mới đẻ chưa mở mắt', NULL, 'Hầu khắp các tỉnh có rừng từ Bắc vào Nam ở độ cao thấp đến 800m. Còn gặp chúng ở các khu rừng phục hồi, thứ sinh ven biển và gần rừng ngập mặn Ở Trung Quốc, nó đã được ghi nhận từ Tứ Xuyên, Vân Nam, Quảng Đông, Quảng Tây, Hồ Nam, Quý Châu, Đảo Hải Nam, Tây Trang, Chiết Giang, Phúc Kiến, Giang Tô, An Huy, Hà Nam và Hồ Bắc (Smith và Xie 2008). Nó đã được ghi nhận từ đảo Đài Loan. Ở Đông Nam Á, nó có mặt ở Myanmar, miền bắc Thái Lan, CHDCND Lào, Việt Nam, miền đông Campuchia và bán đảo Malaysia', NULL, 'Loài đặc hữu của Cúc Phương', NULL, NULL, 'LC', NULL, 'VnCreature'),
(4607, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Sciuridae', 'Sóc Cây', 'FAM_334', 'Callosciurus', NULL, 'GEN_0289', 'callosciurusfinlaysonii', 'Callosciurus finlaysoni', '(Hordsfield, 1823)', 'Sóc đỏ ', 'SPA_04651', 'Đặc điểm nhận dạng:\n\nSóc đỏ cỡ trung bình. Màu sắc lông thay đổi: các chủng quần khác nhau ở Việt Nam có màu đen (ở Côn Đảo), màu đỏ hoặc pha trộn nâu - đỏ hoặc đỏ - xám (ở vùng Sa Thầy, tỉnh Kontum); màu hung xám bụng nâu vàng (ở Phú Quốc).\n\nSinh học, sinh thái:\n\nSống ở rừng già, rừng hỗn giao, đôi khi kiếm ăn ở cả rừng trồng, ở Côn Đảo, hoạt động ở mọi sinh cảnh. Sóc kiếm ăn ban ngày, làm tổ trong các hốc cây. Đẻ 1 - 3 con vào tháng 5 - 8.', NULL, 'Trong nước: Việt Nam có 3 phân loài: Callosciurus finlaysonii germanii Milne-Edwards, 1867 phân bố trong rừng Côn Đảo; Callosciurus fillaysonii harmandi Milne-Edwards, 1877 phân bố trên đảo Phú Quốc và Callosciurus fillaysonii cinnamameus Temminck, 1853 phân bố ở Kontum, Lâm Đồng.\n\nThế giới: Mianma, Thái lan, Lào, Cambodia', NULL, NULL, 'Sóc có mầu sắc đẹp có giá trị thẩm mỹ. Dễ nuôi, có thể nuôi làm động vật cảnh ở công viên, vườn thú', 'LR', NULL, NULL, NULL),
(4608, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Sciuridae', 'Sóc Cây', 'FAM_334', 'Callosciurus', NULL, 'GEN_0289', 'callosciurusflavimanus', 'Callosciurus flavimanus', 'Geoffroy 1831', 'Sóc bụng chân vàng', 'SPA_04652', 'là loài sóc cây cỡ trung bình, có chiều dài từ đầu đến thân từ 16 đến 28 cm và đuôi dài từ 11 đến 26 cm. Cả hai giới đều có kích thước và ngoại hình tương tự nhau và nặng từ 310 đến 460 g sigfig=2. Màu sắc của bộ lông thay đổi đáng kể giữa nhiều phân loài khác nhau, nhưng nhìn chung có màu nâu ở phần thân trên với tông màu hơi đỏ hơn ở bụng và thường có một số màu đen ở đuôi. Kiểu dáng và sắc thái chính xác của lông thường được sử dụng để phân biệt các phân loài với nhau, nhưng gây khó khăn cho việc phân biệt toàn bộ loài này với các loài sóc cây khác, có cùng biến đổi tương tự.', NULL, 'được tìm thấy ở hầu hết vùng Đông Nam Á, bao gồm vùng viễn đông Ấn Độ, Bhutan, phía bắc và phía đông Myanmar, Việt Nam, một phần của Campuchia và Lào, phần lớn Thái Lan, phía bắc bán đảo Malaysia, phía nam và phía đông Trung Quốc, bao gồm Hải Nam và Đài Loan. Trong khu vực này, chúng được tìm thấy trong nhiều môi trường sống rừng ở độ cao dưới 3000 m, bao gồm rừng thường xanh nhiệt đới và cận nhiệt đới, rừng lá rộng rụng lá và rừng lá kim cận nhiệt đới. Các quần thể đã được du nhập vào tỉnh Buenos Aires của Argentina, Bỉ, Hà Lan, Pháp và Nhật Bản.', NULL, NULL, NULL, NULL, NULL, NULL, 'thainationalparks.'),
(4609, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Sciuridae', 'Sóc Cây', 'FAM_334', 'Callosciurus', NULL, 'GEN_0289', 'callosciurusinornatus', 'Callosciurus inornatus', '(Gray, 1867)            ', 'Sóc bụng xám', 'SPA_04653', 'dài 160-185 mm, đuôi thường dài hơn thân nhưng hẹp hơn, dài khoảng 162-192 mm; tai dài 17-20 mm; bàn chân sau dài 41-47,5 mm. Chiều dài sọ nói chung là 44-48 mm, các phân loài riêng lẻ lên đến 51 mm, chiều rộng hợp tử là 28-32,5 mm, chiều dài vòm miệng là 21,5-24,8 mm, chiều dài xương mũi là 13,4-13,9 mm, chiều rộng quỹ đạo là 15,1-15,8 mm, và chiều dài bong bóng thính giác là 10,7-12,4 mm mm, ngà trên dài 9,3 đến 10,7 mm. Hộp sọ về cơ bản giống với hộp sọ của sóc bụng đỏ , chỉ nhỏ hơn một chút. Mặt sau của cơ thể và đuôi của sóc bụng xám có màu nâu ô liu , bề mặt bụng của cơ thể có màu xám, xám xanh, đỏ nhạt, xám đỏ và vàng nhạt; bên thân có màu nâu xám, và một số có một đốm trắng ở mông. Phần trên của đuôi tương tự như phần sau của cơ thể, phần dưới màu sáng hơn một chút so với phần trên, và phần đuôi thường có màu đen . Hộp sọ hơi nhỏ hơn sóc bụng đỏ , xương mũi và vòm miệng ngắn hơn, không gian quỹ đạo hẹp hơn sóc bụng đỏ một chút. Phần cuối phía sau của xương mũi vượt ra ngoài một chút so với phần cuối phía sau của răng tiền hàm và chiều dài của nó ngắn hơn chiều rộng của xương trước; đường viền sau của xương trán thẳng, đường viền răng cửa rất ngắn và ở giữa sau. đường viền của xương vòm miệng hơi nổi rõ. Đường viền sau của răng cối lớn thứ ba trên kéo dài ra phía sau vượt quá mức đường viền sau của xương vòm miệng.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'moitruong.backan'),
(4610, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Sciuridae', 'Sóc Cây', 'FAM_334', 'Callosciurus', NULL, 'GEN_0289', 'callosciurussp', 'Callosciurus sp.', NULL, 'Sóc chân vàng', 'SPA_04654', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4611, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Sciuridae', 'Sóc Cây', 'FAM_334', 'Dremomys', NULL, 'GEN_0609', 'dremomysgularis', 'Dremomys gularis', '(Osgood, 1932)', 'Sóc họng đỏ', 'SPA_04655', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4612, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Sciuridae', 'Sóc Cây', 'FAM_334', 'Dremomys', NULL, 'GEN_0609', 'dremomyspernyi', 'Dremomys pernyi flavior', '(Milne-Edwards, 1867)', 'Sóc má vàng', 'SPA_04656', 'Cơ thể con cái có chiều dài 108,3 mm và đuôi dài 138,8 mm; con đực dài 186mm, đuôi dài 142,5 mm. ', NULL, 'và miền bắc Việt Nam tìm thấy ở đông bắc Ấn Độ, bắc Myanmar, Tây Tạng và các tỉnh khác của Trung Quốc, Đài Loan', NULL, NULL, NULL, NULL, NULL, NULL, 'Wikipedia'),
(4613, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Sciuridae', 'Sóc Cây', 'FAM_334', 'Dremomys', NULL, 'GEN_0609', 'dremomysrufigenis', 'Dremomys rufgenus', '(Blanford, 1878)', 'Sóc mõm hung', 'SPA_04657', 'Dài thân: 172 - 230mm; Dài đuôi: 100 - 190mm; Dài bàn chân sau: 35 - 50mm; Cao tai: 18 - 25mm; Trọng lượng: 160 - 300g; Dài sọ: 51 - 57mm; Rộng gò má: 26 - 31mm. Sóc mõm hung có bộ lông màu nâu sẫm, má và phần duới đuôi có màu hung rỉ sắt. Họng có màu hung đỏ và bụng có màu trắng nhạt. Có một vành trắng xung quanh mắt, Đuôi của sóc mõm hung xù bông và ngắn hơn dài thân Sóc mõm hung sống trong các khu rừng già nguyên sinh và rừng thứ sinh, các trảng cây bụi bìa rừng. Sóc mõm hung là loài hoạt động ban ngày, sống trên cây và trên mặt đất, làm tổ trong các hốc cây. Sóc mõm hung thường kiếm ăn theo đàn. Thức ăn gồm quả hạt và côn trùng. Sinh sản vào mùa xuân đến cuối thu và thường thường mỗi lứa đẻ từ 2 - 3 con.', NULL, 'Việt Nam: Kontum, Đồng Nai (Vườn quốc gia Cát Tiên) Lâm Đồng, Đắc Lắc Thế giới: Nêpan Sikkim, Thái Lan, Indonesia.', NULL, NULL, 'Loài hiếm có ý nghĩa khoa học. Màu sắc đẹp nhiều người ưa thích và bị săn bắt để nuôi làm cảnh. Cần có những biện pháp nhằm nghiêm cấm săn bắt. Khoanh vùng bảo vệ, nhất là rừng có loài này sinh sống.', NULL, NULL, NULL, 'VnCreature'),
(4614, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Sciuridae', 'Sóc Cây', 'FAM_334', 'Menetes', NULL, 'GEN_1205', 'menetesberdmorei', 'Menetes berdmorei', '(Blyth, 1849)', 'Sóc vằn lưng', 'SPA_04658', 'Dài thân: 184; Dài đuôi: 140; Dài bàn chân sau: 40; Cao tai: 16 - 22; Trọng lượng: 130 - 245gam; Dài sọ: 48. 2; Rộng gò má: 24 - 28. Sóc vằn lưng cỡ trung bình trong họ sóc cây Sciuridae, mũi dài, không có lông trên tai. Có hai sọc hai bên sườn nhưng màu lông thay đỗi theo vùng địa lý và lượng mưa. Ở vùng có lượng mưa cao, chúng có một sọc đen giữa lưng và một sọc đen nằm giữa sọc trắng. Ở các khu vực rừng khô, ít mưa, sóc vằn lưng có màu nâu, chỉ có sọc bên màu trắng, Đuôi thường ngắn thua chiều dài đầu và thân Loài sóc này kiếm ăn trên cây nhỏ, xuống mặt đất trong các khu rừng và dọc theo các bìa rừng và cả rừng khộp. Chúng thường phát ra các tiếng kêu lớn vào buổi sáng. Đôi khi loài này cũng thường hay kiếm ăn ở các khu vực canh tác. Sống ở độ cao từ 100m lên tới 1.200m. Mặc dù loài này dành nhiều thời gian của mình kiếm ăn trên mặt đất, đôi khi nó có thể được nhìn thấy chạy dọc theo các cành cây tre bị hỏng, nhưng không bao giờ xa mặt đất.', NULL, 'Việt Nam: Kontum, Đồng Nai (Cát Tiên) Lâm Đồng, Đắc Lắc (Vườn quốc gia Yok Đôn) Thế giới: Thái Lan, Cambodia.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4615, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Sciuridae', 'Sóc Cây', 'FAM_334', 'Ratufa', NULL, 'GEN_1718', 'ratufabicolor', 'Ratufa bicolor', '(Sparrmann, 1778)', 'Sóc đen', 'SPA_04659', 'Sóc cỡ lớn. Gốc mũi, đầu, cổ, lưng đến gốc đuôi màu đen hoặc đen - xám. Phần ngoài chi sau, mu bàn chân, hai bên thân đồng mầu với lưng. Mặt bụng: từ nách chi trước, bụng đến hậu môn, phần trong của chi sau màu vàng nhạt hay vàng đất thó. Mặt ngoài vành tai có túm lông màu đen, mặt trong tai trần. Phần trên mắt màu đen, phần dưới mắt đến má màu vàng sáng, hai bên lỗ mũi và môi màu trắng nhạt. Đuôi dài hơn thân, có lông xù, từ gốc đuôi lông màu đen, ở mút đuôi có túm lông dài, cứng và màu đen.\nViệt Nam có 3 phân loài: Sóc đen côn đảo - Ratufa bicolor condorensis Kloss, 1922; Sóc đen thẫm - Ratufa bicolor gigantea Thomas, 1923; Sóc đen nâu - Ratufa bicolor smithi Robinson et Kloss, 1923. Màu sắc của 3 phân loài Sóc đen khác nhau như sau: Sóc đen côn đảo: màu vàng lan tới cánh tay, có vết đỏ hoe sau gáy; Sóc đen thẫm: không có những đặc điểm như Sóc đen côn đảo, lưng hoàn toàn đen thẫm; Sóc nâu đen: Lưng màu vàng - đen da bò. Sống trên cây, thích trên cây gỗ cao trong các khu rừng sâu trên núi đất có nhiều cây quả, núi đá, rừng già, rừng thứ sinh, rừng tre, nứa có cây gỗ cao hoặc dọc bờ sông, suối. Sóc đen ăn thực vật: quả, chồi, hạt, lá cây (dẻ, sấu, trám trắng, trám đen, bứa, sung, vả, si, đa, ngô, vải, nhãn, chuối...). Thức ăn động vật có một số loài côn trùng, kiến, mối, đôi khi cả trứng chim.. Sóc đen hoạt động vào ban ngày và chủ yếu trên cây. Khi kiếm ăn sóc thường phát ra tiếng kêu “túc...túc...” nên rất dễ phát hiện và bị săn bắn nhiều. Sóc sống đơn độc, ghép đôi trong thời kỳ động dục. Sóc làm tổ trên cành cây cao bằng cành cây nhỏ và lót lá khô mềm. Sóc đen đẻ mỗi năm 2 lần: xuân - hè (tháng 3 - 4) và thu - đông (tháng 10 - 11). Mỗi lứa đẻ 2 đến 3 con, chủ yếu 2 con.', NULL, 'Khắp các rừng núi cây to từ Bắc vào Nam ở độ cao khác nhau. 3 phân loài phân bố ở 3 khu vực khác nhau: Sóc đen thẫm phân bố ở miền Bắc; Sóc đen nâu ở vùng cao nguyên Lang Biang, Di Ring và Tây Ninh; Riêng phân loài Sóc đen côn đảo chỉ phân bố ở Côn Đảo. Nêpan, Ấn Độ, Mianma, Trung Quốc (đảo Hải Nam), Lào, Cămpuchia, Thái Lan, Malaysia, Indonesia.', NULL, NULL, 'Phân loài Sóc đen côn đảo là loài đặc hữu của Côn Đảo, Việt Nam. Có giá trị khoa học, thẩm mỹ và có thể nuôi làm cảnh ở vườn thú.', 'VU', NULL, NULL, 'vncreatures'),
(4616, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Sciuridae', 'Sóc Cây', 'FAM_334', 'Tamiops', NULL, 'GEN_1909', 'tamiopsmacclellandi', 'Tamiops macclellandi', '(Horsfield, 1839)            ', 'Sóc chuột nhỏ', 'SPA_04660', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4617, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Sciuridae', 'Sóc Cây', 'FAM_334', 'Tamiops', NULL, 'GEN_1909', 'tamiopsmaritimus', 'Tamiops maritimus', '(Bonhote, 1900)            ', 'Sóc chuột Hải Nam', 'SPA_04661', 'Loài  sóc có kích thước nhỏ. Dài thân: 205 - 246mm; Dài đuôi: 95 - 117mm; Dài bàn chân sau: 28 - 32mm; Cao tai: 15 - 17mm; Trọng lượng: 40 - 60g; Dài sọ: 33 - 35mm; Rộng gò má: 19 - 21mm. Tai của loài sóc nhỏ này có những túm lông, đầu mút lông có màu trắng. Lưng có màu nâu thẫm và màu lông bò, có hai sọc màu nâu gỉ sắt (phía ngoài và phía trong) trên mỗi bên lưng và một sọc đen giữa sống lưng . Các sọc phía trong và phía ngoài có độ dài như nhau. Những vòng màu trắng xung quanh mắt rất rõ ràng. Bụng có màu trắng nhạt và với những lông xám có mút trắng. Lông đuôi dài, có màu da cam ở gốc, màu đen ở giữa và màu trắng ở mút Sóc chuột Hải Nam sống trong các khu rừng nguyên sinh và thứ sinh, hoạt động vào ban ngày, leo trèo rất giỏi và thỉnh thoảng kiếm ăn d­ới mặt đất. Loài này có thể cùng tồn tại với loài sóc bụng đỏ Callosciurus erythraeus và loài Callosciurus inornatus. Sóc chuột nam hải. Thức ăn là quả một số thực vật và côn trùng sông trong khu vực phân bố.', NULL, 'Trong nước: từ Bắc vào Nam nơi các khu vực rừng còn được bảo vệ tốt. Thế giới: Thái Lan, Cambodia.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4618, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Sciuridae', 'Sóc Cây', 'FAM_334', 'Tamiops', NULL, 'GEN_1909', 'tamiopsrodolphii', 'Tamiops rodolphii', '(Milne-Edwards, 1867)', 'Sóc chuột', 'SPA_04662', 'Chiều dài thân khoảng 117 mm (con đực) và 118 mm (con cái), chiều dài đuôi 111 mm (con đực) và 108 mm (con cái); trọng lượng trung bình khoảng 56g. Có sọc dọc mỏng màu nâu nhạt chia sọc đen ở giữa lưng. Các cặp sọc bên có cùng màu nâu nhạt và có chiều rộng bằng nhau. Gáy và đầu màu nâu xỉn, bụng có màu hơi vàng đến cam, đường phân chia sọc giữa lưng có màu nâu vàng đặc trưng. Hoạt động kiếm ăn ban ngày chủ yếu là sáng sớm và chiều tối. Sống trong nhiều kiểu sinh cảnh rừng khác nhau từ rừng bán thường xanh đến các khu rực rừng trồng hoay rừng bị suy thoái nhẹ. Thức ăn gồm các loại quả, hạt trong khu vực phân bố, làm tổ trong các hốc cây, mỗi lứa đẻ 1 - 3 con, con non chưa mở mắt.', NULL, 'Hầu khắp các tỉnh phía Nam từ Phú Yên, đến Đồng Nai, Bình Dương và Bà Rịa - Vũng Tàu. Đây là loài ít quan tâm nhất trong Sách đỏ IUCN. Sống rộng rãi, số lượng cá thể loài còn gặp ở nhiều môi trường sống khác nhau. Hiện tại không có mối đe dọa lớn nào đối với loài nà ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(4619, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Sciuridae', 'Sóc Cây', 'FAM_334', 'Tamiops', NULL, 'GEN_1909', 'tamiopssp', 'Tamiops sp', NULL, 'Sóc chuột ', 'SPA_04663', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
