(4621, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Spalacidae', 'Dúi', 'FAM_347', 'Rhizomys', NULL, 'GEN_1735', 'rhizomyspruinosus', 'Rhizomys pruinosus', 'Blyth. 1851            ', 'Dúi mốc lớn', 'SPA_04665', 'Dúi mốc lớn nặng khoảng 0,5 - 0,8 kg. Thân hình trụ mập, chiều dài thân 256 – 350 mm, đuôi 100 – 124 mm. Đầu hình nón, cổ ngắn. Chân ngắn, bàn chân to, có năm ngón, ngón có vuốt lớn, hai ngón chân sau liền với nhau. Dúi mốc có bộ lông thô màu mốc đốm trắng. Tai nhỏ, mắt bé ', NULL, 'Tại miền Bắc Việt Nam, dúi mốc lớn có tại Khu bảo tồn thiên nhiên loài vượn Cao Vít, Trùng Khánh, Cao Bằng Loài này phân bố ở Campuchia, Trung Quốc, Ấn Độ, Lào, Malaysia, Myanmar, Thái Lan', NULL, NULL, NULL, NULL, NULL, NULL, 'Wikipedia'),
(4622, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Spalacidae', 'Dúi', 'FAM_347', 'Rhizomys', NULL, 'GEN_1735', 'rhizomyssinensis', 'Rhizomys siensis', 'Gray, 1831', 'Dúi mốc lớn ', 'SPA_04666', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4623, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'RODENTIA', 'GẶM NHẤM', 'ORD_074', 'Spalacidae', 'Dúi', 'FAM_347', 'Rhizomys', NULL, 'GEN_1735', 'rhizomyssumatrensis', 'Rhizomys sumantraensis', '(Raffles, 1821)', 'Dúi', 'SPA_04667', ' Nó là một trong bốn loài chuột tre . Các cá thể có thể đạt chiều dài gần 50 cm (20 in) với đuôi 20 cm (7,9 in) và nặng tới 4 kg (8,8 lb). Chế độ ăn điển hình của chúng bao gồm rễ tre , nhưng chúng cũng ăn khoai mì và mía được trồng ', NULL, ' được tìm thấy ở Campuchia , Trung Quốc , Indonesia , Lào , Malaysia , Myanmar , Thái Lan và Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'Wikipedia'),
(4624, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'SCANDENTA', 'NHIỀU RĂNG', 'ORD_076', 'Tupaiidae', 'Đồi', 'FAM_381', 'Dendrogale', NULL, 'GEN_0561', 'dendrogalemurina', 'Dendrogale murina', '(Schlegel et Muller, 1845)', 'Nhen', 'SPA_04668', 'Đặc điểm nhận dạng:\n\nLoài thú gặm nhấm cỡ nhỏ. Dài thân: 115 - 135; Dài đuôi: 105 - 130; Dài bàn chân sau: 26 - 30; Cao tai 10 - 18; Trọng lượng 35 - 55g; Dài sọ: 34; Rộng gò má: 15 - 17. Nhen có đuôi tròn, được bao phủ bởi một lớp lông ngắn và đều. Loài này có màu lông đen nâu, trên lưng và màu vàng da bò tới bụng, có một dải lông màu tối chạy từ đầu mũi qua mắt và xuống tai. Hai tai rất to. Con non có màu nâu đen tuyền.\n\nSinh học, sinh thái:\n\nNhen là loài hoạt động kiếm ăn ban ngày và thích ở trên những cành cây bụi thấp và trong bụi cây. Thức ăn chủ yếu lá các loài côn trùng sống trong khu vực phân bố. Loài này đặc biệt thích ăn bọ cánh cứng và thỉnh thoảng cũng bắt gặp chúng ăn quả chín. Là loài rất nhút nhát và khó nhìn thấy trong sinh cảnh tự nhiên của chúng. Làm tổ ở trong hang, hốc dưới gốc cây. Mỗi năm đẻ 1 lứa mỗi lứa đẻ thừ 3 - 4 con.', NULL, 'Việt Nam: gặp hầu hết ở các nơi có rừng ở các khe suối và ở cả các khu rừng thứ sinh sau nương rẫy ở các tỉnh từ Bắc đến Nam ở độ cao trung bình thấp.\n\nThế giới: Nêpan, Sikkim, Thái Lan, Indonesia.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4625, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'SCANDENTA', 'NHIỀU RĂNG', 'ORD_076', 'Tupaiidae', 'Đồi', 'FAM_381', 'Tupaia', NULL, 'GEN_2001', 'tupaiabelangeri', 'Tupaia belangeri', '(Wagner. 1841)            ', 'Đồi', 'SPA_04669', 'Loài thú sống trên cây có kích thước trung bình. Chiều dài thân trong khoảng 14 - 18 cm, nặng trung bình 13 g. Màu lông nâu đỏ, xám hoặc đen ở lưng và bụng trắng. Đuôi dài và rậm lông, có màu nâu xám và gần như dài bằng chiều dài thân. Móng nhẵn, có vuốt bén. Có đệm da trên mõm dài. Cả đực và cái có hình dạng giống nhau. Dài đầu đến thân 13 - 185 mm. Dài đuôi 11 - 172 mm, dài chân sau 38 - 46 mm. Thường có một sọc nhạt trên mỗi vai', NULL, 'Trong nước: Loài này phân bố hầu khắp các tỉnh có rừng còn tốt từ Bắc đến Nam ở độ cao trung bình dưới 1.m. Nước ngoài: Vân Nam, Trung Quốc, Lào, Cambodia và Thái Lan.', NULL, NULL, NULL, NULL, 'IC', NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=6100'),
(4626, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'MAMMALIA', 'THÚ', 'CLA_08', 'SCANDENTA', 'NHIỀU RĂNG', 'ORD_076', 'Tupaiidae', 'Đồi', 'FAM_381', 'Tupaia', NULL, 'GEN_2001', 'tupaiaglis', 'Tupaia glis', 'Diard & Duvaucel, 1820', 'Đồi', 'SPA_04671', 'Loài lớn nhất trong số các loài chuột chù trên cây. Mặt sau màu nâu và mặt dưới màu đỏ cam, nhạt hơn ở vùng ngực. Thường có một vài đốm màu cam. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4627, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'CROCODILIA', 'CÁ SẤU', 'ORD_026', 'Crocodylidae', 'Cá Sấu', 'FAM_106', 'Crocodylus', NULL, 'GEN_0488', 'crocodylussiamensis', 'Crocodylus siamensis', '(Schneider, 1801).', 'Cá sấu xiêm', 'SPA_04672', 'Cỡ lớn, chiều dài cơ thể khoảng 2,2 - 2,3m (trên thế giới, cá sấu xiêm lớn nhất đạt tới 4m). Mõm dài. Có từ 1 - 2 đôi tấm sau chẩm. Toàn thân phủ tấm sừng, những tấm sừng ở lưng có dạng hình chữ nhật, tiếp giáp nhau theo hàng ngang. Đuôi cao to, khỏe, phía trên đuôi có 4 gờ. Chân sau có màng bơi nối giữa các ngón. Thân màu xám, bụng nhạt màu hơn so với lưng, khác biệt với cá sấu hoa cà ở phần mõm và các tấm sừng ở đỉnh đầu. Thường sống ở những sông hồ lớn, đầm lầy nước ngọt, nơi nước lặng hoặc chảy chậm. Chúng sống chủ yếu trong nước, ngày nắng nóng mới lên cạn để tự điều chỉnh thân nhiệt. Thức ăn chủ yếu là cá, cua, ếch nhái, chim và thú nhỏ như chuột. Trong điều kiện nuôi, chúng có thể ăn cả mồi chết (phế thải của lò mổ: lòng trâu bò, lợn, gà,...). Cá sấu xiêm giao phối khoảng tháng 12 đến tháng 3 năm sau, kích thước tối thiểu con thành thục khoảng 1,8m. Chúng đẻ trứng mỗi năm 1 lần vào đầu mùa mưa từ tháng 4 - 10 dương lịch, từ 15 - 26 trứng (có khi tới 40 trứng). Một tuần trước khi đẻ, cá sấu đào 1 hố sâu đến 0,5m, rộng 0,8m rồi đẻ trứng vào đó. Chúng thường đẻ vào ban đêm. Sau khi đẻ xong, ổ đẻ được lấp bằng cành lá khô mục làm thành một mô cao đến 0,5m. Cá sấu mẹ có tập tính bảo vệ trứng. Sau khi đẻ 75 - 85 ngày thì trứng nở. Cá sấu sơ sinh dài khoảng 200-300mm.', NULL, 'Kontum (sông Sa Thầy), Gia Lai (sông Ba), Đắk Lắk (sông Ea Súp, sông Krông Ana, hồ Lắk, hồ Krông Pách Thượng), Khánh Hòa, Đồng Nai (nam Cát Tiên), Nam Bộ (sông Cửu Long). Thái Lan, Lào, Cambodia, Malaysia, Indonesia.', NULL, NULL, 'Có gia tri khoa học, thẩm mỹ. Giúp cân bằng sinh thái trong môi trường tự nhiên. Là vật nuôi ở những nơi vui chơi, giải trí (vườn động vật) giúp học sinh, sinh viên tìm hiểu về sinh thái loài.', 'CR', NULL, NULL, 'vncreatures.net'),
(4628, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Acanthosaura', NULL, 'GEN_0013', 'acanthosauracapra', 'Acanthosaura capra', 'Gunther.            ', 'Ô rô Capra', 'SPA_04673', 'Đặc điểm nhận dạng:     \n\nLà loài nhông cỡ lớn (dài thân: 94.1 - 137,9mm, dài đuôi: 137,6 - 182,1mm), tuy nhiên đuôi ngắn hơn nhiều so với loài nhông natalia, phía sau trên ổ mắt có một gai lớn, không có gai nằm giữa màng nhĩ và cùng gáy, không có mảng sẫm màu dạng hình thoi ở vùng gáy. Vảy thân đồng đều, lưng và sườn không có những vảy lớn có gờ xen kẽ với vảy nhỏ; chỉ có 1 hàng vảy có gờ mờ ở vùng giữa bụng. Hàng gai giữa lưng phát triển nhưng không nhô cao như ở loài nhông natalia. Con đực thường có màu xanh lá cây, con cái có màu nâu hoặc xám sẫm.\n\nĐầu dài hơn rộng, phủ vảy nhỏ, không đều. Lỗ mũi tròn, cách tấm mõm 1 vảy nhỏ; tấm mõm rộng gần bằng 2 lần cao; tấm cằm dạng gần hình tam giác, dài hơn rộng một chút, tiếp tục bởi 2, 3 cặp tấm hai bên phân biệt rõ với vảy họng. Gờ má và gờ mắt sắc; gai sau ổ mắt dài gần bằng hoặc bằng các gai gáy; gai sau màng nhĩ nhỏ, không quá 3 mm; không có gai cổ, gai gáy và gai lưng không liên tục; gốc các gai có các vảy cứng; gai trên lưng bé, không tiếp tục trên đuôi. Màng nhĩ rất rõ. Túi họng phát triển, bé hơn ở con cái. Có 13 tấm mép trên, 12 tấm mép dưới ở mỗi bên. Có 12 bản mỏng dưới ngón I, 18 bản mỏng dưới ngón III, 20 bản mỏng dưới ngón IV chi trước; 10 - 12 bản mỏng dưới ngón I, 19 bản mỏng dưới ngón III, 28 bản mỏng dưới ngón IV chi sau.\n\nSinh học, sinh thái:\n\nSống trong các khu rừng thường xanh còn tốt từ độ cao thấp đến 800m so với mặt biển. Thường xuất hiện vào mùa mưa và gần như rất hiếm gặp vào mùa khô. Thức ăn chủ yếu của loài này là các loài côn trùng sống trong khu vực phân bố. Chúng có khả năng phóng chiếc lưỡi dài ra bắt mồi rất ngoạn mục', NULL, 'Ở Việt Nam, loài này hiện ghi nhận phân bố ở các tỉnh Khánh Hoà, Lâm Đồng và Đồng Nai, Bình Phước, Tây Ninh.\n\nThế giới: Cambodia.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4629, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Acanthosaura', NULL, 'GEN_0013', 'acanthosauracoronata', 'Acanthosaura coronata', 'Günther, 1861', 'Ô rô vành', 'SPA_04674', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4630, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Acanthosaura', NULL, 'GEN_0013', 'acanthosauralepidogaster', 'Acanthosaura lepidogaster', 'Cuvier, 1829', 'Ôrô bụng vẩy', 'SPA_04675', 'Ô rô vảy có cơ thể dẹp bên. Sau cổ có một gai và lại có một gai ngắn ở gáy khoảng phía trên màng nhĩ. Các vảy lưng có kích thước không đồng đều. Mặt lưng có màu sẫm nhạt màu da đỏ hay nâu đen không đều chạy ngang lưng và bên chân ở một số các thể sau gáy có vệt xám hình thoi, thân có những vệt trắng mốc. Đuôi các những khúc xám xen kẽ các khúc sánh nhạt. Ô rô vảy có chiều dài thân khoảng 50 - 100mm, đuôi khoảng 65 - 200mm. Ô rô vảy chủ yếu ăn sâu bọ (cánh cứng, châu chấu, gián rừng, kiến, sâu non), ngoài ra chúng còn ăn cả giun, nhện ốc. Ô rô vảy đẻ trứng vào thời gian từ tháng 8 - 10 hàng năm, đẻ khoảng 10 - 20 trứng. Ô rô vảy phổ biến ở những vùng rừng núi trung du. Chúng sống trên các cây trong rừng, sa van hoặc nương bãi. Từ tháng 3, 4 - 10, 11, ô rô hoạt động nhiều về ban ngày. Về mùa đông chúng trú rét trong các khe và hốc cây.', NULL, 'Việt Nam: Cao Bằng, Lào Cai, Yên Bái, Bắc Thái, Lạng Sơn, Vĩnh Phú, Hà Tây, Hòa Bình, Hà Nội, Quảng Ninh, Ninh Bình, Nghệ An, Hà Tĩnh, Quảng Trị, Gia Lai, Kom Tum, Lâm Đồng. Thế giới: Nam Mianma, nam Trung Quốc (kể cả đảo Hải Nam), bắc Thái Lan, Campuchia.', NULL, NULL, 'Ô rô vảy có gíá trị khoa học và thẩm mỹ, có thể nuôi trong các khu vực vườn thú. Hiện nay chúng đang là loài đang bị buôn bán làm cảnh. Có giá trị nghiên cứu khoa học về sinh thái và tập tính của loài. ...', NULL, NULL, NULL, 'VnCreature'),
(4631, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Acanthosaura', NULL, 'GEN_0013', 'acanthosauramurphyi', 'Acanthosaura murphyi', 'Nguyen et al., 2020', '  Nhông  Murphy', 'SPA_04676', ' miền trung Việt Nam, Lào và Campuchia', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4632, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Acanthosaura', NULL, 'GEN_0013', 'acanthosauranataliae', 'Acanthosaura nataliae', 'Orlov, Nguyen & Nguyen, 2006', 'Ô rô Natalia', 'SPA_04677', 'Là loài nhông cỡ lớn (dài thân 115-158 mm, dài đuôi: 171 - 287mm), Đầu dài và cao, phủ vảy nhỏ không đều. Gờ má và gờ mắt sắc, vùng giữa hai mắt lõm. Tấm mõm rộng gấp 3 lần cao, tấm cằm hình tam giác. Có 1 gai lớn sau ổ mắt, không có gai giữa màng nhĩ và mào gáy; không có gai cổ; gai gáy dài; hàng gai dọc sống lưng lớn, xếp dày, tiếp tục đến trên đuôi. Túi họng lớn cả ở con đực và con cái. Có 10 - 11 tấm mép trên, 11 - 12 tấm mép dưới mỗi bên. Chi dài và mảnh, có 9 - 10 bản mỏng dưới ngón I, 21 bản mỏng dưới ngón IV chi trước; 10 - 11 bản mỏng dưới ngón I, 25 - 26 bản mỏng dưới ngón IV chi sau.\n\nVảy trên thân và bên sườn có gờ to nhỏ không đều, có các nốt sần lớn xen kẽ với các vảy nhỏ; có 2 - 3 hàng vảy nhô cao dọc giữa bụng. Trước hậu môn có 5 - 6 vảy phình rộng. Màu sắc đa dạng: dạng thứ nhất thân màu nâu đến nâu xám; phần trên đầu, cổ và gáy màu nâu, vàng nhạt; mép trên và túi họng màu nâu vàng nhạt hoặc màu trắng đục, đôi khi xen kẽ các vệt đen mảnh; ổ mắt đen tiếp tục với vệt đen sau mắt qua màng nhĩ đến gốc vai; đuôi với các khoanh trắng - nâu hoặc đen xen kẽ. Dạng thứ hai thân có màu xanh rêu, mặt trên đầu, cổ và gáy màu vàng đen nhạt; ổ mắt và vệt sẫm phía sau màu đen nhạt; họng và túi họng màu xanh đen; đuôi có các khoanh xanh - đen hoặc nâu xen kẽ. Sống trong các khu rừng thường xanh còn tốt từ độ cao từ 1000 đến 2500m so với mặt biển. Thường xuất hiện vào mùa mưa và gần như rất hiếm gặp vào mùa khô. Thức ăn chủ yếu của loài này là các loài côn trùng sống trong khu vực phân bố. Chúng có khả năng phóng chiếc lưỡi dài ra bắt mồi rất ngoạn mục.', NULL, 'Ở Việt Nam, loài này phân bố ở các tỉnh miền Trung từ Thanh Hoá đến các tỉnh Tây nguyên (Kontum, Gia Lai). ', NULL, NULL, 'Là loài nhông có hoa văn rất đẹp, nên chúng thường bị buôn bán làm vật nuôi cảnh ở Việt Nam và quốc tế. Có giá trị nghiên cứu khoa học về sinh thái và tập tính của loài.', NULL, NULL, NULL, 'vncreatures.net'),
(4633, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Bronchocela', NULL, 'GEN_0254', 'bronchocelasmaragdina', 'Bronchocela smaragdina', 'Günther, 1864            ', 'Nhông đuôi dài', 'SPA_04678', 'Loài nhông có chân thon mảnh, chiều dài thân (chiều dài từ mút mõm đến lỗ huyệt) 106 - 122mm. Chiều dài đuôi gấp 3 đến 3,5 lần chiều dài thân 381 - 410mm. Màng nhĩ ở đường kính nhỏ nhất vào khoảng nhỏ hơn hoặc bằng một nửa đường kính mắt (tỉ lệ 0.43 - 0.51). Đầu phủ vảy nhỏ xếp đều, vảy không phình to, không co lại ở giữa mắt và màng nhĩ. Có 8 vảy mũi và 9  vảy môi dưới ở mỗi bên. Mào vảy gáy được cấu tạo bởi 6 - 12 vảy dựng đứng cực nhỏ, mào lưng tiêu biến. Vảy cằm rộng hơn hai vảy cao sau cằm, túi họng nhỏ ở con đực. Vùng cổ họng phủ lớp vảy hơi phình, nhỏ hơn vảy bụng. Vảy thân trên nhỏ, mềm mượt đến mỏng manh. Có 47 - 54 hàng vảy thân giữa, vảy bụng to gấp hai lần vảy lưng,\n\nNgón chân thứ năm nhỏ và nhỏ hơn ngón thứ tư. Loài này khác biệt với  Bronchocela smaragdina ở vảy đầu mút mõm và 2 vảy cằm sau, với một đường dọc sáng bên thân, những đốm sẫm màu ở con đực (không có đốm) và sọc kẻ sẫm màu đuôi (không có sọc kẻ). Để phân biệt với các loài cùng giống Bronchocela khác ở phần vảy nhỏ trên lưng, ngón thứ năm nhỏ hơn ngón thứ tư, vảy không phình ra sau trên góc của mắt và không phình vảy trên mắt. Màng nhĩ có chút nhỏ hơn một nửa đường kính mắt nhưng không đáng kể. Sống ở các trảng cỏ, cây bụi trong các khu rừng thường xanh còn tốt ở độ cao thấp đến 1.200m ở các tỉnh từ tây nguyên đến miền Đông Nam bộ. Phần đuôi dài gấp 3 đến 3,5 lần thân giúp chúng cân bằng trong khi di chuyển và đuổi bắt con mồi. Thức ăn là những loài côn trùng nhỏ trong khu vực và chỉ xuất hiện trong khoảng thời gian mùa mưa hàng năm.', NULL, 'Từ Kontum, Chư Yang Sin đến Phú Yên, Đồng Nai. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4634, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Bronchocela', NULL, 'GEN_0254', 'bronchocelavietnamensis', 'Bronchocela vetnamensis', 'Hallermann & Orlov, 2005', 'Nhông đuôi dài vietnam ', 'SPA_04679', 'Loài nhông có kích thước nhỏ, dài, những ngón chân rất dài và toàn thân phủ các vảy màu xanh lá cây nên rất khó bị phát hiện trong rừng. Màu xanh đồng nhất và hai hàng chấm trắng nhỏ chạy dọc bên hông đã khiến cho chúng có khả năng lẩn trốn kẻ thù và tìm kiếm thức ăn rất tốt.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4635, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Calotes', NULL, 'GEN_0294', 'calotesbachae', 'Calotes bachae', 'Rödder & Böhme, 2013', 'Nhông bach', 'SPA_04680', 'Lòai nhông có kích thước trung bình, dài đầu và thân đạt tới 97mm; đuôi rất dài 198mm, gấp hơn 2 lần chiều dài đầu và thân; vảy thân nhỏ, kích cỡ không đều, hơi có gờ, sắp xếp thành các hàng không đồng nhất; có 44-50 hàng vảy quanh thân; có 2 gai nhỏ phía trên màng nhĩ; hàng gai gáy và gai lưng nối liền nhau; có một diềm da chạy từ sau hàm đến gần chi trước; có một mảng màu xanh lam ở trên đầu và gáy tới vai, mờ dần ở phía sau chi trước; có một sọc vàng chạy từ phía dưới ổ mắt qua màng nhĩ về góc sau hàm; phần sau thân màu vàng hay nâu nhạt.', NULL, 'Việt Nam: Gia Lai (Sơklang), Đắc Lắc (Eakao, Krong Pach, Nam Đà), Lâm Đồng (Di Linh), Khánh Hoà (Nha Trang), Ninh Thuận (Nha Hố), Bình Dương (Thủ Dầu Một), Đồng Nai, thành phố Hồ Chí Minh, Long An  cho đến Kiên Giang (Hà Tiên)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=1&loai=1&ID=5665'),
(4636, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Calotes', NULL, 'GEN_0294', 'calotesemma', 'Calotes emma', 'Gray, 1845            ', 'Nhông Emma', 'SPA_04681', 'Loài nhông có kích thước trung bình, dài thân 110mm, dài đuôi 265mm, đầu dài hơn rộng. Tấm mõm rộng hơn cao, được viền bởi 4 vảy phía sauvà hai tấm mép trên thứ nhất. Vùng trán, đỉnh hơi lõm. Gờ má, gờ trên mắt sắc. Lỗ mũi tròn, chạm tấm mép trên thứ nhất. Vảy ở trán lớn hơn vảy ở đỉnh . Có gai sau ổ mắt, gai cao không quá 3mm và 2 gai ở phía trên màng nhĩ. Tấm cằm khá lớn. Có 10 tấm mép trên, và 9 -10 tấm mép dưới ở mỗi bên. Phần dưới ngón số IV chi trước có 22 bản mỏng, nhỏ và 27 bản mỏng dưới ngón IV chi sau. Vảy quanh thân gồm 46 hàng. Vảy thân có mấu hướng ra sau và lên trên. Vảy ngực, bụng, chân tay có gờ rất rõ. Vảy dưới đuôi lớn. Có rãnh hay nếp gấp trước vai màu đen. Thân màu nâu xám hay xám nhạt. Có các vệt xẫm màu vắt ngang thân và đuôi. Họng màu hồng nhạt với các chấm đen rải rác. Bụng màu trắng đục. Trong mùa sinh sản, màu của con đực trở nên đậm hơn, khoe ra vùng da lùng nhùng ở cổ họng màu đỏ nhạt và những vệt có góc cạnh bên hông. Chúng phân bố trong các khu rừng mưa nhiệt đới, chủ yếu là rừng thường xanh, nơi đây nó sống trên nền đất rừng giữa các tầng cây thấp dày đặc. Con cái đẻ 4 -12 trứng, trứng được trôn dưới đất mềm hay dưới thảm mục thực vật. Trứng tự nở và phụ thuộc vào nhiệt độ môi trường.', NULL, 'Bắc Thái (Bắc Cạn), Vĩnh Phú (Khả Cửu, Đại Đình), Ninh Bình (Cúc Phương), Nghệ An, Hà Tĩnh (Tân ấp), Quảng Trị (Hồ Xá), Đồng Nai, Bình Phước, Bà Rịa – Vũng Tàu (Côn Đảo) Thế giới: Phân loài bò sát này sống ở phía Nam bán đảo Thái Lan sang Perak thuộc Mã Lai, Trung Quốc, Lào, Cambodia.', NULL, NULL, NULL, NULL, NULL, NULL, 'Agriviet'),
(4637, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Calotes', NULL, 'GEN_0294', 'calotesfruhstorferi', 'Calotes fruhstorferi', '(Werner, 1904)', 'Nhông fructôfe', 'SPA_04682', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4638, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Calotes', NULL, 'GEN_0294', 'calotesmicrolepis', 'Calotes microlepis', '(Boulenger, 1887)', 'Nhông vảy nhỏ', 'SPA_04684', 'Loài nhông có kích thước trung bình, dài thân (SVL) 49 - 76mm, dài đuôi (TailL) 97 - 153mm. Dài đầu hơn cao 1,3 lần. Tấm mõm rộng hơn cao, được viền bởi 4 vảy phía sau và hai tấm mép trên thứ nhất. Vùng trán, đỉnh hơi lõm, gờ má, gờ trên mắt sắc. Lỗ mũi tròn, ở giữa tấm mũi, cách tấm mõm một vảy nhỏ. Có núm gai bé ở vảy sau ổ mắt và phía trên màng nhĩ. Có từ 6 - 7 gai gáy và gai cổ dài, không đều. Các gai dọc theo sống lưng nhỏ. Màng nhĩ rõ, khoảng cách từ màng nhĩ đến sau mắt gần bằng khoảng cách từ trước mắt đến mũi.\n\nVảy thân có mấu hướng ra sau và xuống dưới. Có 63 - 72 hàng vảy bao quanh thân. Có từ 7 đến 10 tấm mép trên, 7 - 9 tấm mép dưới ở mỗi bên. Chi dài và mảnh. Có từ 9 - 11 bản móng dưới ngón I ở chi trước và 23 - 26 bản móng dưới ngón IV chi sau. Mặt trên đầu, thân và các chi có màu xanh, giữa sống lưng có màu nâu và các vệt đen mảnh kéo sang hai bên. Hai bên mắt có các vệt đen mảnh tỏa ra xung quanh. Đuôi có các khoanh xanh - nâu xen kẽ, phần sau đuôi màu nâu. Ở một số cá thể khác thân có màu nâu xám, mặt bụng có màu nhạt hơn. Phần họng có vệt sẫm màu cà phê. Sống ở các khu vực rừng thường xanh còn tốt, thường bám ở trên các cây bụi thấp để săn mồi, thỉnh thoảng cũng thấy chúng leo trèo trên cây gỗ lớn ở độ cao 600 - 1.000m. Thức ăn là các loài côn trùng sống trong khu vực phân bố. Con cái đẻ trứng dưới đất hay dưới thảm mục thực vật. Trứng hoàn toàn phụ thuộc vào nhiệt độ và môi trường.', NULL, ' Bắc Kạn, Quảng Ninh, Thừa Thiên Huế, Đà Nẵng, Lâm Đồng.  Mianma, Trung Quốc, Thái Lan, Lào và Malaysia.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4639, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Calotes', NULL, 'GEN_0294', 'calotesmystaceus', 'Calotes mystaceus', 'Duméril & Bibron, 1837', 'Nhông xám', 'SPA_04685', 'Lòai nhông có kích thước trung bình, dài đầu và thân đạt tới 97mm; đuôi rất dài 198mm, gấp hơn 2 lần chiều dài đầu và thân; vảy thân nhỏ, kích cỡ không đều, hơi có gờ, sắp xếp thành các hàng không đồng nhất; có 44-50 hàng vảy quanh thân; có 2 gai nhỏ phía trên màng nhĩ; hàng gai gáy và gai lưng nối liền nhau; có một diềm da chạy từ sau hàm đến gần chi trước; có một mảng màu xanh lam ở trên đầu và gáy tới vai, mờ dần ở phía sau chi trước; có một sọc vàng chạy từ phía dưới ổ mắt qua màng nhĩ về góc sau hàm; phần sau thân màu vàng hay nâu nhạt.', NULL, 'Việt Nam: Gia Lai (Sơklang), Đắc Lắc (Eakao, Krong Pach, Nam Đà), Lâm Đồng (Di Linh), Khánh Hoà (Nha Trang), Ninh Thuận (Nha Hố), Bình Dương (Thủ Dầu Một), Đồng Nai, thành phố Hồ Chí Minh, Long An  cho đến Kiên Giang (Hà Tiên)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5665'),
(4640, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Calotes', NULL, 'GEN_0294', 'calotesversicolor', 'Calotes versicolor', '(Daudin, 1802)            ', 'Nhông xanh', 'SPA_04686', 'Chiều dài thân: 78 - 83 mm, chiều dài đuôi: 120 - 259 mm. Đầu dài hơn rộng; bề ngang và chiều cao đầu có kích thước tương đương. Mắt có mí động, mi mắt trên phủ nhiều vảy nhỏ. Không có gai trên ổ mắt. Màng nhĩ nông và lộ rõ, có 2 gai riêng biệt phía trên màng nhĩ, cao không quá 2 mm. Hàng gai gáy, gai cổ dài, nối với hàng gai dọc sống lưng ngắn dần về phía sau. Vùng trán, đỉnh hơi lõm. Gờ má, gờ trên mắt sắc. Lỗ mũi tròn, tấm mũi chạm tấm mép trên thứ nhất. Tấm mõm hình chữ nhật, rộng gấp 2 lần cao, được viền bởi 5 vảy nhỏ phía sau và 2 tấm mép trên. Tấm cằm hình tam giác, đường bao ngoài của nó lớn hơn tấm mõm; có 4 cặp tấm sau cằm cách các tấm mép dưới một hàng vảy nhỏ. Có 10 - 11 tấm mép trên và 9 - 11 tấm mép dưới ở mỗi bên.Vảy trên đầu nhẵn, to nhỏ không đều; vảy ở trán lớn hơn vảy ở đỉnh; vảy trên lưng rộng, tất cả các mút nhọn hướng ra sau và lên trên, rộng hơn những vảy ở bụng. Có 43 - 51 hàng vảy bao quanh thân. Vảy ở cằm, họng, bụng, đuôi và các chi nổi gờ rõ. Có 9 - 10 bản mỏng dưới ngón I, 15 - 17 bản mỏng dưới ngón IV chi trước; 10 - 11 bản mỏng dưới ngón I, 20 - 25 bản mỏng dưới ngón IV chi sau. Thân màu vàng nhạt, nâu xám hoặc xanh xám với những vệt màu tối vắt ngang thân. Từ mắt có các vệt đen toả ra xung quanh. Góc cằm và trước vai màu xanh nhạt, cổ họng màu hồng xen các vệt đen. Đuôi tròn có các khoanh màu thẫm nhạt xen kẽ và mờ dần về phía sau. Các cá thể non thân thường có màu nâu nhạt, có hai vệt trắng ở hai bên thân. Chúng là loài thường được thấy ở các công viên, vườn cây, khu đất trồng trọt, đất hoang và trong rừng, nơi đây nó sống giữa các tầng cây thấp rậm lá và cỏ. Con đực trưởng thành thường xuất hiện ở hàng rào và các nơi dễ thấy khác. Thức ăn chủ yếu là các loại côn trùng khác nhau, các động vật nhỏ khác. Vào đầu mùa mưa, con cái dùng chi trước đào một lỗ trong đất, đẻ 4 -12 trứng và lấp lại rồi xóa hết mọi dấu vết. Trứng có kích thước 14 x 8mm; nhông con nở sau năm đến bảy tuần, dài 7cm (kể cả đuôi); chúng trưởng thành trong vòng một năm.', NULL, 'Việt Nam: Chúng hầu như phân bố trên hầu hết các tỉnh ở nước ta. Thế giới: Loài này phân bố rộng khắp từ Srilanka, Ấn Độ và hầu hết Đông Nam châu Á qua phía Nam Trung Quốc bao gồm Hải Nam; Nó không được ghi nhận ở phía Nam Mã Lai và gần đây được ghi nhận ở Singapore.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4641, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Draco', NULL, 'GEN_0607', 'dracoindochinensis', 'Draco indochinensis', '(Smith, 1928)            ', 'Thằn lằn bay đông dương', 'SPA_04687', 'Kích thước nhỏ, màng nhĩ nhẵn hoặc có vài vảy nhỏ. Lỗ mũi hướng lên trên. Mặt lưng màu xám đen hoặc xám nâu. Trên cánh có 5 - 7 dải hoa văn màu đen đậm xen kẽ 5 - 7 dải màu trắng từ thân tỏa ra phía ngoài mỗi cánh (màng da), có các vệt trắng, mãnh chạy dọc. Lưng rải rác chấm đen từ cổ đến đùi. Bụng vàng nhạt. Mào có màu xanh lá cây, cá thể đực có kích thước túi họng lớn hơn so với cá thể cái. Bờ ngoài của chi và đuôi có diềm da hình răng cưa rõ. Chi sau thường ngắn hơn khoảng cách giữa các chi. Mặt lưng có các khoanh đen xen kẽ khoanh trắng rõ ràng. Có 5 xương sườn mỗi bên ở cánh da. Mặt bụng của cánh có 2 vệt màu đen đậm chạy dọc theo diềm cánh ở mỗi bên. Mặt lưng chuyển sang màu xám nhạt khi ngâm trong cồn. sống trên cây ở nơi khô ráo của vùng rừng núi, độ cao từ 500 đến 800m so với mặt nước biển. Hoạt động kiếm ăn, sinh sản, sưởi ấm được thực hiện vào ban ngày, ngủ vào ban đêm. Có khả năng biến đổi màu sắc cơ thể theo màu của môi trường nhằm tránh sự phát hiện của kẻ thù, được xem như hình thức tự vệ thụ động của loài. Nếu chúng đậu trên cành, thân của cây thì màu sắc mặt lưng được biến đổi cùng màu với màu của vỏ cành hoặc vỏ thân cây tại nơi con vật bám', NULL, 'Thằn lằn bay đông dương phân bố ở các tỉnh: Khánh Hòa, Kon Tum, Lâm Đồng, Đồng Nai, Tây Ninh; Thằn lằn bay đốm: Bắc Kạn, Tuyên Quang, Vĩnh Phúc, Lạng Sơn, Quảng Ninh, Hải Dương, Hà Tây (cũ) nay là Hà Nội, Sơn La, Ninh Bình, Thanh Hóa, Nghệ An, Hà Tĩnh, Quảng Bình, Thừa Thiên Huế, Đà Nẵng, Quảng Nam, Lâm Đồng, Bà Rịa Vũng Tàu. Ở hầu khắp các nước Đông nam Á, tới Myanmar', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4642, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Draco', NULL, 'GEN_0607', 'dracomaculatus', 'Draco maculatus', '(Gray, 1845)            ', 'Thằn lằn bay đốm', 'SPA_04688', 'Loài thằn lằn bay nhỏ có chiều dài thân (SVL) 70,22mm, chiều dài đuôi 115,8mm. Họng có một túi da nhỏ, bình thường xếp xuôi xuống ngực và dài đến ngang nách. Hai bên sườn có mảng da lớn, phía trước của mảng da bắt đầu từ nách, phía sau của mảng da phủ đến 1/2 đùi. Mảng da dược nâng đỡ bởi 5 xương sườn nhỏ. Vảy bụng nhỏ, xếp chồng lên nhau và nổi gờ rất rõ. Vảy ở gốc đuôi và trên đuôi lớn hơn, có gờ rất rõ. Vảy trên lưng, đầu và cổ xếp cạnh nhau. Không đều và không có gờ. Mặt trên của mảng da từ màu cam đến màu hồng. Trên màng da và phân trên lưng có các đốm đen nhò, không đồng đều. Mặt dưới màu vàng nhạt đến xám nhạt. Thân màu nhạt mốc với các đốm xám xẫm màu. Khác với các loài thằn lằn bay khác, loài này sống trong rừng nửa rụng lá, thoáng, khô ráo, xanh tươi và rừng mưa nhiệt đới gió mùa, nơi có nhiều cây gỗ lớn và đã ghi nhận chúng sống ở độ cao 2.400m so với mực nước biển. Thức ăn chủ yếu là kiến và các loại ấu trùng, thỉnh thoảng ăn các côn trùng khác, Sinh sản vào đầu mùa mưa, đẻ từ 4 đến 5 trứng trong các lớp vỏ mục ở thân cây hay kẽ nứt.', NULL, 'Việt Nam: Cao Bằng (Ngân Sơn), Vĩnh Phú (Tam Đảo), Hà Tây (Ba Vì), Quảng Ninh (Ba Mùn, Cái Bầu), Thừa Thiên Huế (Bạch Mã), Quảng Nam – Đà Nẵng, Lâm Đồng (Di Linh), Bà Rịa – Vũng Tàu (Côn Đảo)  Thế giới: Ở hầu khắp các nước Đông nam Á, tới Myanmar sang Hải Nam tới Penang.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4643, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Draco', NULL, 'GEN_0607', 'dracosp', 'Draco sp.', NULL, 'Thằn lằn bay', 'SPA_04689', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4644, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Gonocephalus', NULL, 'GEN_0782', 'gonocephaluslepidogaster', 'Gonocephalus lepidogaster', '(Günther, 1872)', 'Ô rô vảy', 'SPA_04690', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4645, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Gonocephalus', NULL, 'GEN_0782', 'gonocephalussp', 'Gonocephalus sp.', NULL, 'Ô rô', 'SPA_04691', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4646, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Leiolepis', NULL, 'GEN_1043', 'leiolepisbelliana', 'Leiolepis belliana ', '(Hardwicke and Gray, 1827)', 'Nhông cát beli', 'SPA_04692', 'Loài nhông có kích thước trung bình, dài thân con đực khoảng 114mm, con cái 107mm, thân dẹp theo hướng lưng bụng, không có mào lưng và gai trên đầu. Vảy nhỏ, phần lớn hóa sừng, vảy ở mặt bụng lớn hơn mặt lưng. Có một hoặc hai nếp họng nhỏ nằm ngang. Lỗ đùi hình thành bởi hai dãy ở vùng mu ở hai bên lỗ huyệt. Đuôi dày lên ở gốc. Mỗi bàn chân có 5 ngòn, các ngón chân dài và có móng nhọn. Kích thước dài và rộng của mõm gần bằng nhau. Miệng được giới hạn bởi hai tấm vảy môi và sáu tấm vảy mõm. Lỗ mũi mở trực tiếp hướng ra ngoài. Trán, vùng gian ổ mắt khá to, các vảy trên ổ mắt là các chấm rất nhỏ. Màng nhĩ rộng và nông, đường kính gần bằng chiều dài lỗ mắt. Hai bên cổ có những nếp da nằm ngang, kéo dài đến gáy.', NULL, 'Việt Nam: Hầu khắp các tỉnh từ Bắc vào Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=44&loai=1&img=1&ID=5761'),
(4647, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Leiolepis', NULL, 'GEN_1043', 'leiolepisguttata', 'Leiolepis guttata', 'Cuvier, 1829', 'Nhông cát', 'SPA_04693', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4648, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Leiolepis', NULL, 'GEN_1043', 'leiolepisreevesii', 'Leiolepis reevesii', '(Gray, 1831)', 'Nhông cát rivo', 'SPA_04694', 'Đặc điểm nhận dạng:\nNhông cát có chiều dài trung bình, đuôi tròn phủ vảy nhỏ, có lỗ đùi. Cá thể đực có màu sắc sặc sỡ, lưng có chấm hình ôvan màu vàng, hoặc da cam viền xám. Cá thể cái không có những hoa văn hình ôvan rõ như cá thể đực. Cá thể đực có hai dải sọc bên lưng không liên tục từ sau mắt đến góc đuôi tạo thành những hoa văn hình ôvan. Trái lại, ở cá thể cái hai dải sọc bên đuôi liền từ sau mắt đến gốc đuôi. ở phần giữa lưng cá thể đực có các hoa văn hình bầu dục màu vàng hoặc da cam viền xám. ở cá thể cái không có các hoa văn rõ như vậy.\nSinh học, sinh thái:\nSống ở vùng cát ven biển, hang, có chiều dài từ 0,6 - 2,5m ở cá thể trưởng thành và 0,2 - 1m ở cá thể chưa trưởng thành. Độ sâu của hang từ 0,2 - 1,2 m. Mỗi hang có 1 - 3 lối thoát phụ. Mỗi cá thể sống trong một hang. Sinh sản từ cuối tháng 5, đầu tháng 6 đến cuối tháng 9. Bắt đầu giao phối từ giữa tháng 5 đến giữa tháng 8, chủ yếu vào 10 giờ sáng và 15 giờ 30 đến 17 giờ. Quả trứng đầu tiên được phát hiện vào đầu tháng 6, quả trứng cuối cùng vào giữa tháng 9. Cá thể cái thường đào một hố cát sâu khoảng 20cm, đẻ khoảng 2 trứng ít khi 3 trứng vào đó rồi lấp cát lên trên trứng. Trong mùa sinh sản bắt gặp 2 - 3 cá thể đực; 4 - 5 cá thể cái. Cá thể đực rượt đuổi từng con cái khác nhau và sau cùng chỉ giao phối với một con cái.', NULL, 'Trong nước: Thanh Hoá, Nghệ An, Hà Tĩnh, Quảng Bình, Quảng Trị.\nThế giới: Nam Trung Quốc (Quảng Đông, Quảng Tây, Hải Nam), Thái Lan, Cămpuchia.', NULL, NULL, 'Có giá trị khoa học và thẩm mỹ, là loài ăn côn trùng nên có lợi cho nông nghiệp.', 'VU', NULL, NULL, 'vncreatures.net'),
(4649, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Physignathus', NULL, 'GEN_1552', 'physignathuscocincinus', 'Physignathus cocincinus', 'Cuvier, 1829            ', 'Rồng đất', 'SPA_04695', 'Rồng đất có chiều dài cơ thể lúc trưởng thành có thể tới 9 cm với con đực và 6 cm với con cái, với màu da từ xanh lá cây tới xanh sẫm gần như đen. Con đực có đầu lớn hớn, hình tam giác góc cạnh hơn con cái', NULL, 'Rồng đất (Physignathus cocincinus), hay còn gọi là kỳ tôm là một loài nhông đặc hữu ở Trung Quốc và Đông Nam Á, loài duy nhất thuộc chi Physignathus, họ Nhông. Loài rồng nước Australia trước đây từng được xếp vào chi Physignathus với danh pháp là Physignathus lesueurii, nhưng đã được chuyển sang chi khác và hiện nay có danh pháp chính thức là Intellagama lesueurii, do chúng không có quan hệ họ hàng gần', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/R%E1%BB%93ng_%C4%91%E1%BA%A5t'),
(4650, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Pseudocalotes', NULL, 'GEN_1648', 'pseudocalotesbrevipes', 'Pseudocalotes brevipes', '(WERNER, 1904)', 'Ô rô gai', 'SPA_04696', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4651, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Pseudocalotes', NULL, 'GEN_1648', 'pseudocalotesmicrolepis', 'Pseudocalotes microlepis', 'Boulenger, 1888', 'Nhông vẩy nhỏ', 'SPA_04697', 'Loài nhông có kích thước trung bình, dài thân (SVL) 49 - 76mm, dài đuôi (TailL) 97 - 153mm. Dài đầu hơn cao 1,3 lần. Tấm mõm rộng hơn cao, được viền bởi 4 vảy phía sau và hai tấm mép trên thứ nhất. Vùng trán, đỉnh hơi lõm, gờ má, gờ trên mắt sắc. Lỗ mũi tròn, ở giữa tấm mũi, cách tấm mõm một vảy nhỏ. Có núm gai bé ở vảy sau ổ mắt và phía trên màng nhĩ. Có từ 6 - 7 gai gáy và gai cổ dài, không đều. Các gai dọc theo sống lưng nhỏ. Màng nhĩ rõ, khoảng cách từ màng nhĩ đến sau mắt gần bằng khoảng cách từ trước mắt đến mũi.\n\nVảy thân có mấu hướng ra sau và xuống dưới. Có 63 - 72 hàng vảy bao quanh thân. Có từ 7 đến 10 tấm mép trên, 7 - 9 tấm mép dưới ở mỗi bên. Chi dài và mảnh. Có từ 9 - 11 bản móng dưới ngón I ở chi trước và 23 - 26 bản móng dưới ngón IV chi sau. Mặt trên đầu, thân và các chi có màu xanh, giữa sống lưng có màu nâu và các vệt đen mảnh kéo sang hai bên. Hai bên mắt có các vệt đen mảnh tỏa ra xung quanh. Đuôi có các khoanh xanh - nâu xen kẽ, phần sau đuôi màu nâu. Ở một số cá thể khác thân có màu nâu xám, mặt bụng có màu nhạt hơn. Phần họng có vệt sẫm màu cà phê được bao quanh bởi các viền màu vàng chanh.\n\nSinh học, sinh thái:\n\nSống ở các khu vực rừng thường xanh còn tốt, thường bám ở trên các cây bụi thấp để săn mồi, thỉnh thoảng cũng thấy chúng leo trèo trên cây gỗ lớn ở độ cao 600 - 1.000m. Thức ăn là các loài côn trùng sống trong khu vực phân bố. Con cái đẻ trứng dưới đất hay dưới thảm mục thực vật. Trứng hoàn toàn phụ thuộc vào nhiệt độ và môi trường.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=6092'),
(4652, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Agamidae', 'Nhông', 'FAM_009', 'Rhysiganthus', NULL, 'GEN_1750', 'rhysiganthuscocincinus', 'Rhysiganthus cocincinus', '(Cuvier, 1829).', 'Rồng đất', 'SPA_04698', 'Rồng đất (kỳ tôm) có chiều dài cơ thể khoảng 240mm, cá thể cái thường có thân và đuôi dẹp bên rõ rệt. Vảy thân có cỡ đều nhau. Có một mào gáy và một mào lưng nối liền nhau và kéo dài từ gáy tới đuôi. Mào ở cá thể đực thường cao hơn cá thể cái. Ở mặt trong đùi có 4 đến 8 lỗ (lỗ trước huyệt hoặc lỗ đùi). Mặt trên thân có màu xanh hay xanh thẫm, mặt bụng màu trắng. Đuôi có những khúc xám nâu xen kẽ với những khúc vàng. Rồng đất thường sống ở trung du và miền núi trong các bụi cây leo bên bờ suối. Cuộc sống của chúng gắn bó với môi trường nước. Chúng di chuyển nhanh nhẹn trên mặt đất, đôi khi leo lên cây và thường bám vào các cành cây mọc ngang trên mặt nước, bơi giỏi, song chỉ trong những trường hợp cần thiết. Ăn côn trùng, nhiều chân và cả giun đất. Đẻ khoảng 5 - 16 trứng vào một hố cát giữa các tảng đá bên cạnh vực nước rồi lấp cát lên trong thời gian từ tháng 4 - 8 hàng năm. Mùa đông ẩn trong các hang hốc khô ráo, hoặc trong các bọng cây mục ẩm.', NULL, 'Hà Giang, Cao Bằng, Yên Bái, Bắc Cạn, Thái Nguyên, Lạng Sơn, Hoà Bình, Bắc Giang, Quảng Ninh, Vĩnh Phúc (Tam Đảo); Hà Tây (Ba Vì), Phú Thọ, Ninh Bình (Cúc Phương), Thanh Hoá, Nghệ An, Hà Tĩnh, Quảng Bình, Quảng Trị, Thừa Thiên - Huế, Quảng Nam, Kontum, Gia Lai, Lâm Đồng, Tây Ninh, Bình Phước, Đồng Nai, Kiên Giang.  Nam Trung Quốc (Quảng Đông, Quảng Tây, Vân Nam), Lào, Cămpuchia, Đông Thái Lan.', NULL, NULL, 'Là loài bò sát cỡ tương đối lớn có mào đẹp nên có giá trị thẩm mỹ, thường được nuôi trong các vườn động vật để giúp học sinh, sinh viên tìm hiểu về đời sống sinh thái của chúng.', 'VU', NULL, NULL, 'vncreatures'),
(4653, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Anguidae', 'Thằn Lằn Rắn', 'FAM_019', 'Dopasia', NULL, 'GEN_0602', 'dopasiagracilis', 'Dopasia gracilis', 'Gray,1845', 'Thằn lằn rắn gracilis', 'SPA_04699', 'SVL tối đa 208 mm; lỗ tai lớn hơn lỗ mũi; mũi tách khỏi trán bằng 3 (hiếm khi 2) vảy; vảy lưng có vảy cứng; các hàng vảy dọc giữa các nếp gấp bên 14–18; vảy dọc theo nếp bên 81–97; đốt sống từ tập bản đồ đến xương chi sau 47–52; hai sọc sẫm màu xuất hiện ở mỗi bên cơ thể: sọc lưng bên từ một chiều dài đầu sau lỗ tai đến chóp đuôi, rộng dần về phía sau; sọc bụng bên hẹp hơn nhưng rõ ràng hơn sọc lưng bên (Campden-Main 1970, Brygoo 1987, Lin và cộng sự 2003, pers. obs.) (Hình 1, 4A trong NGUYEN và cộng sự 2011). ', NULL, ' Ấn Độ (Assam, Arunachal Pradesh, Meghalaya, Mizoram, Nagaland, Bắc Bengal, Sikkim, Darjeeling, Himachal Pradesh), Nepal, S Trung Quốc (Hồ Nam, Vân Nam, v.v.), N Myanmar (Miến Điện), N Đông Dương, Thái Lan, Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'https://reptile-database.reptarium.cz/species?genus=Dopasia&species=gracilis'),
(4654, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Anguidae', 'Thằn Lằn Rắn', 'FAM_019', 'Dopasia', NULL, 'GEN_0602', 'dopasiahainanensis', 'Dopasia hainanensis', '(Yang, 1984)', 'Thằn lằn rắn hải nam', 'SPA_04700', 'SVL tối đa 285 mm; lỗ tai rất nhỏ, như một mũi kim; mũi cách mũi trước 2 vảy; vảy lưng có đường caro yếu ở phần trước lưng, cong dần về phía sau thân và đuôi; hàng vảy dọc giữa nếp bên 20, vảy dọc nếp bên 95–101; đốt sống từ tập bản đồ đến phần còn lại của xương chân sau 53–54; có sọc lưng sẫm màu, từ chiều dài một đầu sau lỗ tai đến chóp đuôi, không rõ ràng ở phía trước, rộng dần và rõ hơn ở phía sau; không có sọc bụng bên (Yang 1983; pers. obs., NGUYEN et al. 2011). ', NULL, 'Trang trại cây Xinan, Điếu La Sơn, Đảo Hải Nam, Trung Quốc, độ cao: 950 m', NULL, NULL, NULL, NULL, NULL, NULL, 'https://reptile-database.reptarium.cz/species?genus=Dopasia&species=hainanensis'),
(4655, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Anguidae', 'Thằn Lằn Rắn', 'FAM_019', 'Dopasia', NULL, 'GEN_0602', 'dopasiaharti', 'Dopasia harti', '(Boulenger, 1899)', 'Thằn lằn rắn hác', 'SPA_04701', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4656, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Anguidae', 'Thằn Lằn Rắn', 'FAM_019', 'Ophisaurus', NULL, 'GEN_1380', 'ophisaurusharti', 'Ophisaurus harti', 'Boulenger, 1899', 'Thằn lằn rắn hác', 'SPA_04702', 'Cơ thể chúng được tạo hoá trang hoàng màu nâu đỏ nhạt với các vạch ngang màu xanh trên lưng. Các con nhỏ phía trên có màu nâu mờ xám xịt với các chấm đen nhỏ, chúng cũng có một dải màu nâu đậm chạy từ mõm, dọc theo hông phía trên đường rãnh, tới đuôi và một dải thứ hai hẹp hơn phía dưới đường rãnh. Các vảy hình chữ nhật sáng bóng tạo thành những sống chạy dài liên tục và được bố trí theo các hàng ngang thẳng.  Loài này phân bố ở vùng có khí hậu lạnh hơn  sống chủ yếu ở miền Bắc và nơi có độ cao từ 1400m trở lên. Thức ăn của nó chủ yếu là côn trùng. Vào cuối mùa mưa nó đẻ từ 4 đến 7 trứng lẫn trong rác rừng; Con cái có tập tính canh gác và bảo vệ trứng. Thằn lằn con mới nở dài khoảng 1,8cm', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4657, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Anguidae', 'Thằn Lằn Rắn', 'FAM_019', 'Ophisaurus', NULL, 'GEN_1380', 'ophisaurussokolovi', 'Ophisaurus sokolovi', 'Darevski & Nguyen, 1983', 'Thằn lằn rắn Sôkôlôp', 'SPA_04703', 'Kích thước nhỏ nhắn hơn người bà con của Thằn lằn rắn hác Ophisaurus harti, cơ thể được trang điểm một màu nâu nhạt và những hang vảy dọc khá đồng đều xếp dọc theo thân. Một vệt đen rất rõ chạy dọc từ giữa hông thân đến mút đuôi. Mặc dù không chân nhưng chúng thực sự là một kẻ quán quân về độ trườn và lẩn trốn nhanh như điện chui vào các đám thảm mục thực vật mỗi khi cảm nhận thấy bị đe doạ. Khi bị bắt chúng giả vờ chết bẳng cách nhắm mắt và thân hình mềm nhũn, thõng thượt. Nhưng chỉ trong tích tắc sơ hở của kẻ thù nó lao mình vào kẹt đá, hốc cây nhỏ hay những chiếc lá khô thì khó có cơ hội nhìn thấy lẩn nữa. Loài mới phát hiện ở các dãy núi cao thuộc miền trung Việt Nam từ Huế đến Lâm Đồng. Nơi sống là các tầng cây thấp nơi các thảm mục thực vật dày, ẩm và hiếm khi nhìn thấy chúng ngoại trừ khi loài này sưởi nắng vào các buổi sáng mát trời hoặc sau cơn mưa.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4658, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Aniliidae', 'Rắn Hai Đầu', 'FAM_022', 'Cylindrophis', NULL, 'GEN_0527', 'cylindrophisjodiae', 'Cylindrophis jodiae', 'Amarasinghe et al. 2015', 'Rắn hai đầu jo-di', 'SPA_04704', 'Loài rắn có kích thước trung bình. Chiều dài thân:  297 - 328 mm, chiều dài đuôi: 78 - 98 mm.Đầu dẹp, không phân biệt với cổ. Tấm mõm cao hơn rộng, thấy một phần từ phía trên, gần có hình tam giác, nhỏ, đỉnh ăn sâu vào đường tiếp giáp giữa hai tấm mũi. Lỗ mũi gần tròn, ở giữa tấm mũi nguyên. Không có tấm gian mũi, tấm má và tấm trước mắt; có 1 tấm sau mắt; tấm thái dương 1+2. Có 6 tấm mép trên, tấm thứ 3, 4 tiếp giáp mắt; 6 tấm mép dưới, 3 tấm đầu tiên chạm tấm sau cằm thứ nhất; 2 cặp tấm sau cằm, cặp thứ nhất dài và rộng hơn cặp thứ hai, cặp thứ hai phân cách nhau bởi 2 vảy nhỏ. Vảy thân 19 - 21(23) - 17(15) hàng nhẵn, đồng cỡ, mút vảy tròn, xếp thẳng hàng; 182 - 192 tấm bụng; 7 tấm dưới đuôi; tấm hậu môn chia.', NULL, 'Việt Nam: Hầu khắp các tỉnh Nam bộ từ Đồng Nai, Bình Dương, Bình Phước đến Cà Mau. Loài này trước đây bị nhầm với Cylindrophis ruffus và mới phát hiện và công bố năm 2015 sau khi đã phân tích sinh học phân tử và hình thái. Loài mới được vinh danh nhà nghiên cứu Lưỡng cư người Úc, tiến sỹ Jodi J. L. Rowley thuộc Viện Bảo tàng Australia vì những đóng góp của bà trong các nghiên cứu và phát hiện nhiều loài mới ở Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=20&loai=1&ID=6088'),
(4659, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Aniliidae', 'Rắn Hai Đầu', 'FAM_022', 'Cylindrophis', NULL, 'GEN_0527', 'cylindrophisruffus', 'Cylindrophis ruffus', '(Laurenti, 1768)            ', 'Rắn trun (R hai đầu đỏ)', 'SPA_04705', 'Loài rắn có kích thước trung bình. Chiều dài thân: 297 – 328mm, chiều dài đuôi: 78 – 98mm.Đầu dẹp, không phân biệt với cổ. Tấm mõm cao hơn rộng, thấy một phần từ phía trên, gần có hình tam giác, nhỏ, đỉnh ăn sâu vào đường tiếp giáp giữa hai tấm mũi. Lỗ mũi gần tròn, ở giữa tấm mũi nguyên. Không có tấm gian mũi, tấm má và tấm trước mắt; có 1 tấm sau mắt; tấm thái dương 1+2. Có 6 tấm mép trên, tấm thứ 3, 4 tiếp giáp mắt; 6 tấm mép dưới, 3 tấm đầu tiên chạm tấm sau cằm thứ nhất; 2 cặp tấm sau cằm, cặp thứ nhất dài và rộng hơn cặp thứ hai, cặp thứ hai phân cách nhau bởi 2 vảy nhỏ. Vảy thân 19 – 21(23) – 17(15) hàng nhẵn, đồng cỡ, mút vảy tròn, xếp thẳng hàng; 182 – 192 tấm bụng; 7 tấm dưới đuôi; tấm hậu môn chia. Mặt lưng màu xám đen, mỗi bên có 27 – 51 sọc thẳng đứng màu vàng nhạt, xếp so le hoặc có khi nối với nhau; chiều rộng sọc nhỏ hơn nhiều so với khoảng cách giữa chúng. Phía bên từ sườn tới bụng có một hàng từ 40 – 51 sọc, dày hơn, xếp so le, có khi nối với sọc trên lưng hoặc liền nhau ở mặt bụng. Trên đầu xám đen. Họng và môi trên, môi dưới có những vết màu vàng nhạt.', NULL, 'Việt Nam: Hầu khắp các tỉnh Nam bộ từ Đồng Nai, Bình Dương, Bình Phước đến Cà Mau.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://agriviet.org/dong-vat-rung/ran-trun-r314/'),
(4660, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Boidae', 'Trăn', 'FAM_046', 'Python', NULL, 'GEN_1701', 'pythonbivittatus', 'Python bivittatus', 'KUHL, 1820', 'Trăn đất', 'SPA_04706', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4661, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Boidae', 'Trăn', 'FAM_046', 'Python', NULL, 'GEN_1701', 'pythonmolurus', 'Python molurus', '(Linnaeus, 1758)            ', 'Trăn đất Ấn Độ', 'SPA_04707', 'Đặc điểm nhận dạng:\nRắn lành cỡ rất lớn trong họ nhà Trăn Pythonidae, dài tới 8m (kích thước trung bình khoảng từ 4 - 6m). Đầu dài, nhỏ. Hai tấm vảy môi trên có trên mỗi tấm vảy một lỗ (lỗ môi là cơ quan cảm giác nhiệt). Có hai cựa nhỏ, hình móng nằm ở hai bên khe huyệt. Cựa trăn cái ngắn, ẩn sâu trong hốc bên khe huyệt. Đầu có màu nâu xám, mặt trên đầu có hoa văn hình mũi mác di từ cổ, mũi nhọn hướng về phía đầu mõm. Mặt trên lưng có màu xám nhạt hay vàng nhạt có một dãy những vết lớn dài, màu nâu đỏ viền đen. Mặt bụng màu vàng hay nâu vàng có những đốm nâu hay đen.\nSinh học, sinh thái:\nThường sống ở các rừng thưa, savan, cây bụi hay ven các rừng già, ở các đồi núi thấp có nhiều bụi rậm khô ráo. Chúng ưa sống gần các vực nước, đầm lầy. Có thể leo lên cây và thích cuốn mình vào những cành cây chìa ra trên mặt nước. ở đồng bằng Nam bộ, chúng ưa sống ở những nơi đầm lầy, rừng tràm, rừng sú vẹt ngập nước, đôi khi còn xâm nhập cả vào những khu vực có vườn cây. ở miền Bắc Việt Nam về mùa đông, Trăn đất trú đông từ 2 đến 4 cá thể trong những hang hốc tự nhiên để tránh rét. Chúng chủ yếu đi kiếm mồi vào ban đêm, nhiều nhất vào lúc xẩm tối. Chúng ưa ngâm mình vào trong nước trong những ngày nóng bức. Trăn đất ăn những loài thú nhỏ (chủ yếu gặm nhấm, đôi khi cả hươu nai cỡ nhỏ, chim và những loài ếch nhái, bò sát). Sinh sản hàng năm. Trăn ở vùng Minh Hải giao phối từ tháng 10 đến tháng giêng năm sau (thời gian giao phối được gọi là trăn hội). ở miền Bắc chủ yếu từ tháng 11 đến tháng giêng năm sau. Trước khi giao phối, trong mùa trăn hội thường có 3 - 5 Trăn đực tìm đến một trăn cái. Cuối cùng chỉ có một con đực được giao phối còn các cá thể đực khác cuốn với nhau thành một búi lớn. Trăn chửa khoảng hai tháng đến ba tháng sáu ngày, đẻ từ 15 đến 60 quả trứng. Trăn mẹ ấp trứng bằng cách cuộn lấy ổ trứng. Sau khoảng hai tháng (56 - 85 ngày) thì trứng nở: Trăn sơ sinh dài khoảng 52 - 61cm và nặng khoảng 80 - 140g. Lột xác lần đầu khoảng 7 - 10 ngày sau khi nở.', NULL, 'Trong nước: Phân bố ở hầu khắp các tỉnh trung du và miền núi Việt Nam, kể cả ở vùng rừng tràm và rừng đước Nam Bộ.\nThế giới: Pakistan, Ấn Độ, Bănglađét, Xri Lanka, Mianma, Nêpan, nam Trung Quốc (Phúc Kiến, Quảng Đông, Quảng Tây, Vân Nam, Hải Nam và Hồng Kông), Thái Lan, Lào, Cămpuchia, Malaixia, Inđônêxia.', NULL, NULL, 'Là loài bò sát đẹp có giá trị khoa học và thẩm mỹ, được nuôi nhốt ở nhiều công viên, vườn thú để làm cảnh và giáo dục môi trường cho học sinh, sinh viên.', 'CR', NULL, NULL, 'vncreatures.net'),
(4662, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Boidae', 'Trăn', 'FAM_046', 'Python', NULL, 'GEN_1701', 'pythonreticulatus', 'Python reticulatus', '(Schneider, 1801)            ', 'Trăn gấm', 'SPA_04708', 'Rắn cỡ lớn nhất trong các loài rắn, có thể dài tới 6 – 7m. Đầu nhỏ dài, phân biệt rõ với cổ. Bốn tấm vảy môi trên đầu tiên, ở mỗi tấm có một lỗ cảm giác (lỗ môi). Lỗ môi cũng có ở các tấm vẩy môi dưới thứ hai, thứ ba và từ thứ mười hai cho đến thứ mười bảy hay mười tám. Ở chính giữa đầu có một đường màu đen mảnh đi từ mõm tới gáy. Có một đường màu đen mảnh đi từ mõm tới gáy và có thêm một đường màu đen mảnh đi từ sau mắt xiên xuống góc môi. Mặt lưng màu vàng be hay vàng nâu với những vân xám đen nối với nhau làm thành những mắt lưới. Mặt bụng và dưới đuôi có màu trắng hoặc vàng nhạt với những chấm nhỏ màu nâu xám hay đen. Cá thể cái trưởng thành thường lớn hơn cá thể đực trường thành. Sống ở rừng thưa, nơi có đồi núi thấp hoặc savan cây bụi, đặc biệt nơi sống đều ở gần môi trường nước. Trăn gấm bơi giỏi có tập tính tương tự như Trăn đất, Trăn gấm hoạt động về ban đêm, có thể đẻ tới 100 trứng/ lứa, trăn mẹ có tập tính cuốn lấy trứng. Trứng nở sau khoảng hai tháng rưỡi đến 3 tháng. Con non mới nở dài khoảng 60 đến 75cm. Trong điều kiện nuôi, chúng thích đầm mình cả ngày trong nước và ăn nhiều loại mồi. Thức ăn bao gồm những loài động vật đẳng nhiệt.', NULL, 'Đà Nẵng, Kontum, Gia Lai, Đắk Lắk, Bình Định, Khánh Hoà, Bình Phước, Tây Ninh, Đồng Nai, Long An, Thành phố Hồ Chí Minh, Kiên Giang, Cà Mau, Bà Rịa - Vũng Tàu. Ấn Độ, Bănglađét, Brunây, Mianma, Lào, Thái Lan, Cămpuchia, Malaixia, Xingapo, Inđônêxia, Philippin.', NULL, NULL, 'Là loài bò sát có hoa văn và màu sắc đẹp, có giá trị, thẩm mỹ và là loài được nuôi ở nhiều các công viên, vườn thú để làm cảnh và giáo dục môi trường cho học sinh, sinh viên.', 'CR', NULL, NULL, 'vncreatures'),
(4663, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Achalinus', NULL, 'GEN_0021', 'achalinusater', 'Achalinus ater', 'Deuve, 1970. ', 'Rắn xe điếu đen', 'SPA_04709', 'Rắn có kích thước nhỏ, chiều dài cơ thể đạt tới 322mm, đường nối 2 vảy gần mũi xấp xỉ bằng 2 lần đường nối của 2 vảy trước trán hai bên 2 vảy thái dương. Mép trên có 6 vảy, có 23 hàng vảy thân. Những vảy dưới đuôi xếp thành một hàng. Mặt lưng thường nâu, có khi xám đen. Mặt bụng nhạt màu hơn lưng. Rắn xe điếu nâu sống ở rừng các khu rừng thường xanh núi cao từ 1000m trở lên và còn gặp loài này ở độ cao 2000m.', NULL, 'Cao Bằng (Ngân Sơn), Vĩnh Phú (Tam Đảo). Nam Trung Quốc, (kể cả đảo Hải Nam), Lào.', NULL, NULL, 'Rắn xe điếu xám cũng là một trong những loài rắn đẹp và hiếm cần được bảo vệ. Có thể nuôi làm cảnh hoặc phát triển trang trại vì là loài rắn không độc nên dễ nuôi.', 'R', NULL, NULL, 'vncreatures.net'),
(4664, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Achalinus', NULL, 'GEN_0021', 'achalinusrufecens', 'Achalinus rufecens', 'Boulenger, 1888', 'Rắn xe điếu nâu', 'SPA_04710', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4665, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Achalinus', NULL, 'GEN_0021', 'achalinusspinalis', 'Achalinus spinalis', 'Peters, 1869', 'Rắn xe điếu xám', 'SPA_04711', 'Loài rắn có cơ thể nhỏ. Chiều dài cơ thể tới 600mm. Có 2+2 vảy thái dương, 21 - 25 hàng vảy thân, những vảy dưới đuôi xếp thành một hàng. Lưng nâu nhạt, đỏ nâu hay xanh lam. Bụng vàng nhạt hay trắng hoặc xám đen, có hay không có một đường xám đen chạy dọc lưng. Dưới ánh sáng mặt trời lớp vảy phản quang với nhiều dạng màu sắc lấp lánh. Rắn đẻ 4 - 7 trứng thai. Rắn xe điếu xám sống ở rừng núi, tới độ cao 1500m còn gặp.', NULL, 'Lào Cai (Sapa), Bắc Thái, Vĩnh Phú (Tam Đảo). Nam Trung Quốc, Lào, Nhật Bản.', NULL, NULL, 'Rắn xe điếu xám cũng là một trong những loài rắn đẹp và hiếm cần được bảo vệ. Có thể nuôi làm cảnh hoặc phát triển trang trại vì là loài rắn không độc nên dễ nuôi.', 'R', NULL, NULL, 'vncreatures.net'),
(4666, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Ahaetulla', NULL, 'GEN_0052', 'ahaetullanasuta', 'Ahaetulla nasuta', '(Lacepede, 1789).', 'Rắn roi mõm nhọn ', 'SPA_04712', 'Loài rắn có cơ thể mảnh, nhỏ. Chiều dài thân 765 - 800mm, chiều dài đuôi 400 - 425mm. Đầu dài, mõm hẹp và nhọn, phân biệt rõ với cổ, gờ mõm và mắt sắc. Mắt lớn, con ngươi hình elip nằm ngang. Tấm mõm rộng hơn cao. Đường nối giữa 2 tấm trước trán gần gấp 2 lần đường nối giữa 2 tấm gian mũi. Tấm trán dài và hẹp, nhỏ hơn tấm trên mắt, chiều dài tấm trán ngắn hơn khoảng cách từ từ nó tới mút mõm. Có 2 tấm má, 1 tấm trước mắt lớn, phần trên tiếp xúc với tấm trán.có 10 tấm mép trên ở mỗi bên, tấm thứ 4, 5 và 6 chạm mắt. Có 9 tấm mép dưới, 4 tấm đầu tiên chạm tấm sau cằm thứ nhật; cặp tấm sau cằm thứ 2 dài gấp 2 lần cặp tấm sau cằm thứ nhất. Vảy thân có 15 hàng, nhẵn và xếp thành hàng xiên, hàng vảy giữa sống lưng lớn hơn các hàng vảy bên cạnh. 191 vảy bụng, 158 vảy dưới đuôi 176 - 186 kép. Tấm hậu môn chia. Thân có màu xanh lá cây, mặt bụng màu nhạt hơn phần lưng và một vệt trắng đục kéo dài hai bên sườn.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Đỗ Tước và Đặng Thanh Long (2013). Chuyên đề điều tra đa dạng động vật rừng trên địa bàn thành phố Hà Nội. Chi Cục Kiểm lâm Hà Nộ'),
(4667, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Ahaetulla', NULL, 'GEN_0052', 'ahaetullaprasina', 'Ahaetulla prasina', '(Boie,1827)            ', 'Rắn roi thường', 'SPA_04713', 'Thân màu xanh lục nhạt hay đậm ở phía trên và xanh lục nhạt ở phía dưới với một đường kẻ nhuyễn dọc theo mép bụng. Tuy nhiên màu sắc của chúng có thể thay đổi từ xanh sang cam và nâu. Đây là loài rắn khá dài chiều dài của nó có thể đạt tới 197cm. Một khác biệt của loài này là vùng hậu môn bị chia tách và có nhiều vảy bụng (194 - 235) và nhiều vảy dưới đuôi (151 - 235). Đầu nhọn và thường rất hay đưa phẩn lưỡi ra ngoài để cảm nhận nhiệt độ mội trường. Loài rắn này sống trên cây, hoạt động ban ngày này còn bắt gặp sống trong khu vực rừng rậm cao đến 2.100m. Thức ăn chủ yếu của loài này là thằn lằn, ếch nhái. Đẻ từ 4 - 10 con; Rắn con mới nở dài khoảng 35cm và giống rắn lớn. Đây là loài rắn roi phổ biến và lớn nhất trong khu vực Đông nam Á và đôi khi chùng được ghi nhận ở trong các bụi rậm còn sót lại ở các thành phố lớn.', NULL, ' Chúng hầu như loài này sống ở hầu khắp các khu vực có rừng từ Bắc tới Nam và khắp vùng Đông nam châu Á.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4668, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Ahetualla', NULL, 'GEN_0054', 'ahetuallaprasina', 'Ahetualla prasina', 'Boie', 'Rắn roi thường', 'SPA_04714', 'Hình dạng cơ thể cực kỳ mảnh khảnh với mõm dài, nhọn, dài hơn mắt gấp đôi. Màu sắc trưởng thành thay đổi từ nâu nhạt đến xanh lục vàng xỉn và thường có màu xanh lục huỳnh quang đáng kinh ngạc.', NULL, 'Loài rắn này phân bố rộng rãi ở châu Á, nơi nó xuất hiện ở Bangladesh , Bhutan , Brunei , Miến Điện , Campuchia , Trung Quốc , Ấn Độ , Indonesia , Lào , Malaysia , Philippines , Singapore , Thái Lan và Việt Nam ', NULL, NULL, NULL, NULL, 'LC', NULL, 'https://en.wikipedia.org/wiki/Ahaetulla_prasina'),
(4669, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Amphiesma', NULL, 'GEN_0083', 'amphiesmaatemporale', 'Amphiesma atemporale', '(Bourret, 1934)', 'Rắn sãi thái dương', 'SPA_04715', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4670, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Amphiesma', NULL, 'GEN_0083', 'amphiesmabitaeniatum', 'Amphiesma bitaeniatum', '(Wall, 1925)', 'Rắn sãi kut-kai', 'SPA_04716', 'Thân tương đối thon dài, hình trụ. Đầu thon dài, hơi hẹp, phân biệt với cổ. Mõm dài, hơi phẳng, hẹp ở mút khi nhìn từ trên xuống, tròn khi nhìn từ mặt bên. Khoé mắt không rõ. Mũi nằm mặt bên. Mắt lớn, đường kính gấp 2 lần khoảng cách mắt mõm. Đồng tử tròn. Đuôi dài, hình trụ và nhọn chót. Răng hàm trê 17-19 cái bằng nhau + 2 cái răng nở rộng rõ, không có kẽ hở răng. Dài thân 520 mm, dài đuôi 188 mm. Vảy bụng 166. Vảy dưới đuôi 86, kết cặp. Lỗ huyệt phân chia. Vảy lưng có công thức hàng 19-19-17, kết sừng ở phần trên của lưng, ít kết sừng hơn ở phần dưới, hàng vảy đầu tiên mịn. Không có hốc đỉnh. Mõm rộng gấp 1.6 lần cao. Mũi vuông góc, dài hơn cao, chia đôi, có khoé nhọn ngay giữa mũi. Vảy gian mũi hình tam giác, dài nhỉnh hơn rộng, hẹp phía trước. Vảy trán cánh cung, dài gấp 1.5 -1.7 lần rộng. Vảy trước trán dài và rộng hơn vảy gian mũi. Vảy trên mắt 1. Vảy môi trên 8. Vảy sau mắt 3/3. Vảy trước mắt 1/1. Vảy môi dưới 10/10. Trong trạng thái ngâm cồn: Mặt lưng màu xám nâu sẫm phía trên, nâu nhạt ở mặt bên, nhạt hơn hẳn ở lưng, có nhiều vảy của hai bên thân và lưng mang viền nâu đen. Hàng vảy dãy cột sống nhạt hơn hẳn các vảy lân cận. Mặt lưng bên có sọc màu vàng trải rộng trên dãy vảy lưng thứ 5, thứ 6 và 7, bao quanh bên dưới có một vạch nâu đen đơn rõ ở nửa trên của dãy vảy xương sống thứ 4 và phần thấp hơn của dãy vảy xương sống thứ 4, và ở phía trên được bao bởi đường kẻ nâu đen đứt nét không đều, mảnh hơn trên cùng của dãy vảy lưng thứ 7. Mắt đen. Bụng màu vàng kem, có đốm nâu sẫm nhỏ thon dài gần mép ở ¾ chiều rộng của vảy. Cằm và họng vàng, có đốm nâu xám nhạt trên vảy môi dưới.', NULL, 'Trong nước: Lào Cai (Vườn quốc gia Hoàng Liên), Sơn La, Lai Châu.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=5&loai=1&img=1&ID=5995'),
(4671, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Amphiesma', NULL, 'GEN_0083', 'amphiesmaboulengeri', 'Amphiesma boulengeri', 'Gressitt, 1937', 'Rắn sãi bou len go', 'SPA_04717', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
