(4675, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Amphiesma', NULL, 'GEN_0083', 'amphiesmamodestum', 'Amphiesma modestum', '(Günther, 1875)', 'Rắn sãi trơn', 'SPA_04723', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
