(4677, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Amphiesma', NULL, 'GEN_0083', 'amphiesmaparallela', 'Amphiesma parallela', 'Malnate, 1960', 'Rắn sãi sọc', 'SPA_04725', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4678, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Amphiesma', NULL, 'GEN_0083', 'amphiesmapopei', 'Amphiesma popei', '(Schmidt, 1925)', 'Rắn sãi po pay', 'SPA_04726', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4679, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Amphiesma', NULL, 'GEN_0083', 'amphiesmasauteri', 'Amphiesma sauteri', '(Boulenger, 1909)', 'Rắn sãi Sau te', 'SPA_04727', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4680, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Amphiesma', NULL, 'GEN_0083', 'amphiesmasp', 'Amphiesma sp', '            ', 'Rắn sãi', 'SPA_04728', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4681, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Amphiesma', NULL, 'GEN_0083', 'amphiesmastolatum', 'Amphiesma stolatum', '(Linnaeus, 1758)            ', 'Rắn sãi thường', 'SPA_04730', '“Mắt vừa phải. Rostral rộng gấp đôi sâu, chỉ có thể nhìn thấy từ trên cao; các lỗ mũi bên trong thu hẹp nhiều về phía trước, dài bằng chiều rộng hoặc dài hơn một chút, gần bằng chiều rộng của phần trán trước và từ hai phần ba đến gấp đôi chiều rộng, dài hơn khoảng cách từ cuối mõm, dài bằng phần đỉnh; loreal miễn là sâu hoặc sâu hơn một prae- và ba ống nhòm; thời gian 1+1 hoặc 1+2; bình thường tám môi trên, thứ ba, thứ tư và thứ năm đi vào mắt; năm hoặc sáu môi dưới tiếp xúc với phần cằm trước, ngắn hơn phần sau. Vảy thành 19 hàng, có gờ chắc chắn, hàng ngoài nhẵn. Bụng 12-161; chia hậu môn: phần dưới đuôi 5-89. Ô liu màu xanh lục hoặc hơi nâu, có ít nhiều đốm đen rõ ràng hoặc các thanh ngang dạng lưới giao nhau bởi hai dải dọc màu vàng, rõ nhất là ở phía sau; præ- và postculars có bề mặt dưới màu vàng nhạt, màu trắng, thường có một đốm đen ở mỗi bên của mỗi bụng.” (Boulenger 1893: 253) ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4682, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Bioga', NULL, 'GEN_0224', 'biogacyanea', 'Bioga cyanea ', '(Dumeril et Bibron, 1854)', 'Rắn ráo xanh', 'SPA_04731', 'Con trưởng thành có kích thước rất lớn, chiều dài cơ thể của chúng khoảng 1,87cm, nặng 1,6kg. Đầu và thân dài của loài rắn này có màu xanh lục ôliu với phía trên màu xám nhạt hoặc xanh nhạt; bụng màu vàng nhạt ở phía trước và màu trắng nhạt ở phía sau. Cằm và cổ họng màu trắng có sắc màu xanh nhạt. Vảy bụng có đường bên không rõ rệt. Thức ăn của loài này là chim nhỏ, rắn khác. Con cái đẻ 4 - 13 trứng; rắn con màu nâu nhạt, đỏ nhạt hay hồng, có thể có các vạch ngang màu nâu đậm, dài khoảng 35cm. Loài rắn có màu sắc hấp dẫn này sống ở các khu rừng cao đến 2.100m. Thỉnh thoảng bắt gặp chúng kiếm ăn trên mặt đất vào ban đêm.', NULL, ' Gia Lai (Sơklang), Đắc Lắc (Ekao), Sông Bé (An Lộc), Đồng Nai (Trảng Bom), thành phố Hồ Chí Minh Miền Nam Thái Lan tới đảo Phuket, cũng như Assam, Myanmar, phía Nam Trung Quốc và Lào, Nêpan, Cambodia', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4683, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Boiga', NULL, 'GEN_0232', 'boigabourreti', 'Boiga bourreti', 'Tillack, Ziegler & Le Khac Quyet, 2004', 'Rắn rào bua-rê *', 'SPA_04732', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4684, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Boiga', NULL, 'GEN_0232', 'boigacyanea', 'Boiga cyanea', '(Dumeril, Bibron&Dumeril, 1854)           ', 'Rắn rào xanh', 'SPA_04733', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4685, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Boiga', NULL, 'GEN_0232', 'boigacynodon', 'Boiga cynodon', '(Boie, 1827)', 'Rắn boi ga', 'SPA_04734', 'Đặc điểm nhận dạng:\nRắn rào răng chó có đầu phân biệt rõ với cổ. Mắt lớn. Vảy giữa lưng 21 - 23 hàng, hàng vảy chạy giữa lưng có kích thước lớn hơn những vảy lưng khác. Tấm hậu môn đơn. Mặt lưng vàng nhạt, nâu hoặc đỏ, phía trước thân có các khoang xám đen xen khoang sáng nhạt hay những vết thẫm chạy ngang, càng về cuối thân càng mờ. Bụng vàng nhạt. Chiều dài cơ thể tới 2m.\nBoiga cynodon có những đặc điểm hình thái khác với các loài cùng giống Boiga như sau:\nRắn rào đốm trắng Boiga drapiezii không có sọc mắt màu nâm xám, mà chủ yếu có vết sáng màu hơn, có đốm bụng trắng đến vàng và 19 hàng vảy thân. Rắn rào răng chó Boiga cynodon có một vết sáng ở giữa những sọc tối, không có đốm trắng ở mặt thấp hơn, có vết đốm đuôi hẹp và rõ, có bụng trắng hoa văn chocolate. Rắn rào ngọc Boiga jaspidea có đốm thâm ở đầu, sọc ngang hơn là xiên ở thân, bụng màu vàng ở phần trước chuyển sang màu trắng ở phần bụng sau. Rắn rào răng chó Boiga cynodon là loài có răng nanh ẩn sâu phía sau các răng hàm (reared-fang), các răng nanh này lại rất nhỏ, ngắn và xếp gọn ở sâu trong hàm răng của rắn nên rất khó để phát hiện. Khi bị cắn, độc tố có thể gây đau và viêm, sưng đáng kể nhưng không nguy hiểm hoặc đe dọa tính mạng con người.\nSinh học, sinh thái:\nRắn ráo răng chó sống trên cây, hoạt động và kiếm ăn chủ yếu về đêm. Thỉnh thoảng bắt gặp chúng trên mặt đất. Thức ăn chủ yếu của loài này là các loài lưỡng cư hay các loài thú nhỏ như chuột, đôi khi chúng ăn trứng chim và thằn lằn.', NULL, 'Việt Nam: Lào Cai, Yên Bái, Bắc Thái, Tây Ninh, Bình Dương, Bình Phước (Vườn quốc gia Bù Gia Mập), Đồng Nai (Vườn quốc gia Cát Tiên). Thế giới: Ấn Độ, Mianma, Thái Lan, Lào, Cambodia, Malaysia, Philippin.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4686, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Boiga', NULL, 'GEN_0232', 'boigaguangxiensis', 'Boiga guangsinensis', 'Wen, 1998', 'Rắn rào quảng tây', 'SPA_04735', 'Một thùy trán, hai thùy sau, và 2-3 thùy thái dương trước và ba thùy thái dương sau; tám vảy trên môi (3-5 tiếp xúc với mắt), 11-12 vảy dưới môi và 21 vảy (mặt lưng nhẵn) chạy khắp phần giữa cơ thể; 265 vảy bụng và 144 vảy dưới đuôi chia đôi; Đáng chú ý là tấm hậu môn, nguyên vẹn nhưng có nếp gấp ở giữa và 1-2 mắt trước (ở bên trái, có hai mắt trước; ở bên phải, đường khâu giữa “cả hai vảy” không hoàn chỉnh), với đỉnh cao nhất đỉnh đầu nhưng không chạm vào trán ', NULL, 'Việt Nam: Lào Cai (Cốc San), Cao Bằng (Nguyen Binh), Lạng Sơn([Mẫu Sơn, Hữu Lũng), Thái Nguyên (Kỳ Phú), Vĩnh Phúc (Tam Đảo), Bắc Giang (Lục Nam), Quảng Bình (Phong Nha-Kẻ Bàng), Kon Tum (Kon Plong), Gia Lai (Trâm Lập), Lâm Đồng (Đà Tẻh), Tây Ninh (Tây Ninh) và Đồng Nai (Biên Hòa), Đắc Lắc Trung Quốc (Vân Nam)', NULL, NULL, NULL, NULL, NULL, NULL, 'The reptarium database.'),
(4687, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Boiga', NULL, 'GEN_0232', 'boigakraepelini', 'Boiga kraepelini', 'Stejneger, 1902', 'Rắn rào krapelin', 'SPA_04736', 'là một loài rắn dài và mỏng, có thể phát triển tổng chiều dài (bao gồm cả đuôi) là 160 cm (63 in). Đầu và mắt của nó rất lớn với chiều rộng đầu gấp đôi cổ. Đồng tử giống mèo, đặc trưng của loài này. Màu sắc của bề mặt trên của thân và đuôi thường có màu hổ phách hoặc nâu đến nâu đồng, với các dải chéo màu nâu đến đen khuếch tán không đều dọc theo đường đốt sống.', NULL, 'Loài này là loài đặc hữu của Đông Á và Đông Nam Á (Đài Loan, Trung Quốc, Việt Nam và Lào)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Boiga_kraepelini'),
(4688, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Boiga', NULL, 'GEN_0232', 'boigamultitemporalis', 'Boiga multitemporalis', '(Blyth, 1861)', 'Rắn rào thái dương', 'SPA_04738', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4689, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Boiga', NULL, 'GEN_0232', 'boigamultomaculata', 'Boiga multomaculata', '(BOIE, 1827)            ', 'Rắn rào đốm', 'SPA_04739', 'Đầu phân biệt rõ với cổ. Mắt trung bình, con ngươi hình elip thẳng đứng. Lỗ mũi nằm giữa hai tấm mũi. Có một tấm trước mắt, một tấm bên mắt và hai tấm sau mắt. Có 8 tấm mép trên, tấm thứ 3,5 và 5 chạm mắt, 10 – 12 tấm mép dưới, 4 tấm đầu tiên chạm tấm sau cắm thứ nhất. 19 hàng vảy thân, nhẵn, hàng vảy sống lưng rộng hơn vảy bên. Vảy phía trước thân xếp thành hàng xiên. Vảy bụng từ 195 đến 244 tấm. Vảy dưới đuôi 92 – 96 hàng, kép. Thân màu nâu với hai hàng đốm nâu thẩm có viên sáng, hơi lệch nhau về hai bên lưng. Vùng vảy gần sát bụng có hai hàng đốm nâu nhạt và nhỏ hơn ở hai bên. Giữa đầu có một vệt đen hình chữ V từ tấm mõm mở rộng sang hai bên đầu. Gáy có một đốm đen tròn hay bầu dục. Môi có các vệt đen nhạt, rải rác có các vệt nâu sẫm. Chiều dài thân 245 – 680mm, chiều dài đuôi 61 – 180mm Loài rắn rào đốm khác biệt này cư trú ở các khu rừng có nước nhiều và còn gặp ở độ cao 1.210m so với mực nước biển. Thức ăn chủ yếu của loài này được biết đến là bò sát, chim. Con cái đẻ 4 – 8 trứng, rắn con mới nở dài 20cm.', NULL, 'Việt Nam: Lạng Sơn (Ngân Sơn), Lào Cai, Bắc Thái, Lạng Sơn, Vĩnh Phú (Tam Đảo), Ninh Bình (Cúc Phương), Nhệ An, Hà Tĩnh, Đà Nẵng, Gia Lai, Ninh Thuận, Sông Bé, Đồng Nai, Tây Ninh và thành phố Hồ Chí Minh Thế giới: Phân bố ở nhiều nơi ở Đông nam châu Á bao gồm bán đảo Mã Lai, Singapore và Thái Lan', NULL, NULL, NULL, NULL, NULL, NULL, 'Agriviet'),
(4690, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Boiga', NULL, 'GEN_0232', 'boigasiamensis', 'Boiga siamensis', 'Nutaphand, 1971', 'Rắn rào hoa', 'SPA_04740', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4691, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Calamaria', NULL, 'GEN_0276', 'calamariadominici', 'Calamaria dominici', 'Boulenger, 1980', 'Rắn mai gầm Do-mi-nic ', 'SPA_04741', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4692, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Calamaria', NULL, 'GEN_0276', 'calamariapavimentata', 'Calamaria pavimentata', 'Dumeril &Bibron, 1854           ', 'Rắn mai gầm lát', 'SPA_04742', 'Cơ thể của nó mảnh mai và có màu chủ yếu là màu nâu, với các sọc đen dọc hẹp chạy dọc theo toàn bộ chiều dài của cơ thể và trên đuôi.\nTrên cổ có một chiếc cổ màu nâu sẫm đến hơi đen, phía sau là một chiếc cổ hẹp màu vàng hoặc cam. Các vảy môi trên môi cũng có đốm màu vàng hoặc cam, màu này kéo dài đến phần trước của cổ. Mặt dưới cũng có màu vàng hoặc cam.', NULL, 'Ba Vì', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4693, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Calamaria', NULL, 'GEN_0276', 'calamariaseptentrionalis', 'Calamaria septentrionalis', '(Boulenger, 1890)            ', 'Rắn mai gầm bắc', 'SPA_04743', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4694, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Calamaria', NULL, 'GEN_0276', 'calamariastrigiventris', 'Calamaria strigiventris', 'Poyarkov, Nguyen, Orlov & Vogel, 2019', 'Rắn sậy bụng sọc', 'SPA_04744', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4695, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Cerberus', NULL, 'GEN_0346', 'cerberusrhynchops', 'Cerberus rhynchops', '(Schneider, 1799)', 'Rắn sec be', 'SPA_04745', 'Hàm trên lộ rõ, khiến nó trông giống một con chó. Đầu dài và khác biệt với cổ. Đôi mắt nhỏ và tròn, có con ngươi tròn. Phần lưng màu xám đen, có những đốm đen mờ và một đường sẫm màu chạy dọc hai bên đầu, ngang mắt. Kem ở giữa có hai hàng đốm lớn màu xám đen lan tỏa rõ rệt', NULL, 'Nó có nguồn gốc từ vùng nước ven biển Nam và Đông Nam Á', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Cerberus_rynchops'),
(4696, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Chrysopelea', NULL, 'GEN_0406', 'chrysopeleaornata', 'Chrysopelea ornata', '(Shaw, 1802)            ', 'Rắn cườm', 'SPA_04746', 'Loài rắn có kích thước nhỏ, chiều dài thân khoảng 130cm. Đầu màu xanh lục có những vệt màu đen; cằm và phía trên mép màu ngà voi. Thân màu vàng xanh lục nhạt. Mỗi vảy thân trơn bóng có viền đen; vài vảy đen hoàn toàn, tạo thành vạch ngang. Bụng màu xanh lục với các chấm tròn đen kế mỗi vết khía hình V. Thức ăn chủ yếu của chúng là thằn lằn, các loài gặm nhấm và các rắn nhỏ khác. Con cái đẻ từ 6 - 12 trúng; Rắn con dài 15 - 20cm, trông giống rắn lớn nhưng màu và hoa văn của chúng thì sáng hơn. Loài rắn hoạt động ban ngày này sống ở các đồng bằng và đồi cao đến 550m', NULL, 'Việt Nam: Yên Bái (Phiêng Bang), Bắc Thái, Nghệ An (Kỳ Sơn), Quảng Bình (Tân Ấp), Quảng Trị (Khe Sanh), Quảng Nam Đà Nẵng, Kontum, Gia Lai, Đắc Lắc (Buôn ma Thuột, Eakao), Khánh Hoà, Ninh Thuận, Tây Ninh, Đồng Nai (Biên Hoà, Trảng Bom), thành phố Hồ Chí Minh, An Giang, Tiền Giang, Sóc Trăng, Minh Hải (U Minh). Thế giới: Loài rắn nhanh nhẹn này được tìm thấy trên mọi miền của Thái Lan và ở phía Bắc bán đảo Mã Lai, cũng như ở Ấn Độ và các vùng phía Nam Trung Quốc, Myanmar', NULL, NULL, NULL, NULL, NULL, NULL, 'Vn Creature'),
(4697, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Coelognathus', NULL, 'GEN_0445', 'coelognathusflavolineatus', 'Coelognathus flavolineatus', 'Schlegel, 1837', 'Rắn sọc vàng', 'SPA_04747', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4698, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Coelognathus', NULL, 'GEN_0445', 'coelognathusradiatus', 'Coelognathus radiata   ', '(Schlegel,1837)', 'Rắn sọc dưa', 'SPA_04748', 'Đây là loài rắn lành (không độc), cỡ lớn trong họ Rắn nước, dài tới 2m. Đầu tương đối nhỏ thuôn dài, màu nâu xám,phân biệt rõ với cổ. Lưng màu nâu xám, có bốn đường màu đen chạy từ gáy xuống tới quá nửa thân, hai đường giữa to chạy dài liên tục, hai đường bên cạnh nhỏ hơn và đứt đoạn. Có một đường chạy ngang qua gáy. Từ mắt có ba đường đen nhỏ, hai đường chạy xiên xuống môi trên còn một đường qua thái dương nối với vòng đen ở gáy', NULL, 'Loài này phân bố ở Việt Nam, Ấn Độ, Bangladesh, Trung Quốc, Myanmar, Lào, Thái Lan, Campuchia, Malaysia, Singapore, Indonesia.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/R%E1%BA%AFn_s%E1%BB%8Dc_d%C6%B0a'),
(4699, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Cyclophiops', NULL, 'GEN_0520', 'cyclophiopsmajor', 'Cyclophiops major', 'Ota, 1991. ', 'Rắn nhiều đai lớn', 'SPA_04749', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4700, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Cyclophiops', NULL, 'GEN_0520', 'cyclophiopsmulticinctus', 'Cyclophiops multicinctus', '(Roux, 1907)            ', 'Rắn nhiều đai nhỏ', 'SPA_04750', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4701, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Dendrelaphis', NULL, 'GEN_0557', 'dendrelaphisformotus', 'Dendrelaphis formotus', '(Schlegel).', 'Rắn roi', 'SPA_04751', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4702, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Dendrelaphis', NULL, 'GEN_0557', 'dendrelaphisngansonensis', 'Dendrelaphis ngansonensis', '(Bourret, 1935)            ', 'Rắn leo cây ngân sơn', 'SPA_04752', 'Rắn leo cây là loài phổ biến và quen thuộc nhất trong khu vực Đông Nam Á. Đặc điểm chính của loài này là lưng và đầu có màu giống như đồng, trên mặt có các dải màu đen chạy xuống cổ. Trên hai hàng vảy thân có sọc màu vàng hoặc màu kem được viền phía trên và dưới bởi một đường kẻ đen. Bên hông đầu và cằm màu trắng. Những đốm màu xanh dương phân bố khi thân vươn dài để hít thở vào và để dọa nạt. Bụng màu vàng sáng xanh lục nhạt.', NULL, 'Việt Nam: Cao Bằng (Ngân Sơn, Lai Châu, Lào Cai (Thái Niên, Sapa), Bắc Thái (Kí Phí), Lạng Sơn, Vĩnh Phú, Quảng Ninh (Cẩm Phả), Ninh Bình (Cúc Phương), Nghệ An, Hà Tĩnh, Quảng Nam Đà Nẵng, Gia Lai, Đẵc Lắc, Khánh Hoà, Sông Bé, Đồng Nai, thành phố Hồ Chí Minh, An Giang, Kiên Giang, Minh Hải.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=3&loai=1&img=1&ID=6033'),
(4703, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Dendrelaphis', NULL, 'GEN_0557', 'dendrelaphispictus', 'Dendrelaphis pictus', '(Gmelin, 1789)            ', 'Rắn leo cây', 'SPA_04753', 'Rắn leo cây là loài phổ biến và quen thuộc nhất trong khu vực Đông Nam Á. Đặc điểm chính của loài này là lưng và đầu có màu giống như đồng, trên mặt có các dải màu đen chạy xuống cổ. Trên hai hàng vảy thân có sọc màu vàng hoặc màu kem được viền phía trên và dưới bởi một đường kẻ đen. Bên hông đầu và cằm màu trắng. Những đốm màu xanh dương phân bố khi thân vươn dài để hít thở vào và để dọa nạt. Bụng màu vàng sáng xanh lục nhạt. Chiều dài thân 460mm, chiều đài đuôi 730mm. Phần đầu phân biệt rất rõ với cổ. Mắt lớn, con ngươi tròn. Tấm mà dài. Tấm thái dương 1+1+2. Có 9 tấm mép ở mỗi bên, tấm thứ 4,5,6 chạm mắt, có 10 tấm mép dưới, 5 tấm đầu tiên chạm tấm sau cằm thứ nhất. Có 15 hàng vảy thân nhẳn, xếp thành hành xiên, hàng vảy sống lưng hình 6 góc, lớn hơn các vảy bên cạnh. Co 187 vảy bụng và 154 - 155 vảy dưới đuôi, kép. Vảy bụng và vảy dưới đuôi có gờ rất rõ ở hai bên. Loài bò sát có màu sắc đẹp này thường sống ở các môi trường tự nhiên đa dạng tại các đồng bằng và đồi núi có độ cao ít nhất là 1.300m. Chúng kiếm ăn thường vào ban đêm. và là loài rắn không độc đối với con người. Thức ăn chủ yếu của loài này là thằn lằn, ếch sống trên cây và ếch ruộng. Con cái đẻ 2 - 10 trứng; rắn con khi nở dài khoảng 25cm. Trong 3 loài thuộc giống Dendrelaphis sp.ở Việt Nam gồm 3 loài được phân biệt như sau: Dendrelaphis pictus, - có hai vảy dưới mắt; có sọc trắng bên hông. Dendrelaphis ngansonensis - có hai vảy dưới mắt; không có sọc trắng bên hông. Dendrelaphis subocularis - có 1 vảy dưới mắt', NULL, 'Việt Nam: Cao Bằng (Ngân Sơn, Lai Châu, Lào Cai (Thái Niên, Sapa), Bắc Thái (Kí Phí), Lạng Sơn, Vĩnh Phú, Quảng Ninh (Cẩm Phả), Ninh Bình (Cúc Phương), Nghệ An, Hà Tĩnh, Quảng Nam Đà Nẵng, Gia Lai, Đẵc Lắc, Khánh Hoà, Sông Bé, Đồng Nai, thành phố Hồ Chí Minh, An Giang, Kiên Giang, Minh Hải. Thế giới: Loài rắn này có mặt phần nhiều ở châu Á nhiệt đới như Trung Quốc, Thái Lan, Mianma, Malayxia, Philippin..', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
