(4706, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Dinodon', NULL, 'GEN_0585', 'dinodonmeridionale', 'Dinodon meridionale', '(Bourret, 1935)', 'Rắn lệch đầu kinh tuyến', 'SPA_04756', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4707, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Dinodon', NULL, 'GEN_0585', 'dinodonrufozonatum', 'Dinodon rufozonatum', '(Cantor, 1842)', 'Rắn lệch đầu hoa', 'SPA_04757', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4708, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Dinodon', NULL, 'GEN_0585', 'dinodonseptentrionale', 'Dinodon septentrionale', '(Günther, 1875)', 'Rắn lệch đầu thẫm', 'SPA_04758', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4709, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Dryocalamus', NULL, 'GEN_0612', 'dryocalamusdavisoni', 'Dryocalamus davisoni', '(Blanford, 1878)', 'Rắn dế ', 'SPA_04759', 'Loài rắn có kích thước nhỏ, con cái có chiều dài từ mút mõm đến lỗ huyệt 587.7 mm, dài đuôi 191.4 mm. Đầu phân biệt với cổ. Vảy mũi không phân chia. Vảy má 1/1, nối với mắt. Không có vảy trước mắt. Vảy sau mắt 2/2. Vảy trước thái dương 1/1. Vảy sau thái dương 2/2. Vảy môi trên 7/7, trong đó vảy thứ ba và bốn chạm mắt. Vảy môi dưới 8/8. Công thức hàng vảy lưng 13 - 13 - 13, tất cả vảy bụng đều mịn. Vảy bụng 239 (+1 vảy trước bụng). Vảy huyệt không phân chia. Vảy dưới đuôi 109, rẽ đôi.', NULL, 'Trong nước: Hoà Bình, Quảng Bình, Quảng Trị, Thanh Hóa, đến Kiên Giang.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=5&loai=1&img=1&ID=5984'),
(4710, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Dryophis', NULL, 'GEN_0615', 'dryophisfiasinus', 'Dryophis fiasinus', 'Holttum & P.J. Edwards', NULL, 'SPA_04760', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4711, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Elaphe', NULL, 'GEN_0634', 'elaphefrenatus', 'Elaphe frenatus', 'Gray, 1853.', 'Rắn sọc má', 'SPA_04761', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4712, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Elaphe', NULL, 'GEN_0634', 'elapheleonardi', 'Elaphe leonardi', '(Wall, 1921)', 'Rắn sọc đốm tím', 'SPA_04762', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4713, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Elaphe', NULL, 'GEN_0634', 'elaphemandarina', 'Elaphe mandarina', '(CANTOR, 1842)', 'Rắn sọc quan', 'SPA_04763', 'Rắn lành, dài khoảng 1m. Đầu không phân biệt rõ với cổ. Lưng màu hồng điều, chính giữa cổ và lưng có một dãy hình quả trám mầu đen, ở giữa có vết màu vàng nằm ngang. Có một vết màu xám đen chạy ngang qua mõm, một vết thứ hai chạy ngang đỉnh đầu qua hai mắt, một vết thứ ba làm thành hình L ở gáy. Bụng màu vàng có những vết to màu xám đen nằm ngang so le với nhau. ', NULL, ' Lai Châu, Lào Cai, Sơn La, Lạng Sơn, Vĩnh Phúc, Hà Tĩnh. Ấn Độ, Trung Quốc (Đài Loan), Mianma, Lào.', NULL, NULL, 'Có giá trị bảo vệ thực vật (chủ yếu ăn chuột), thẩm mỹ (có hoa văn, màu sắc đẹp). Rắn sọc quan cỡ lớn được nuôi làm cảnh trong vườn thú để giáo dục môi trường đối với học sinh, sinh viên.', 'VU', NULL, NULL, 'agriviet.org'),
(4714, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Elaphe', NULL, 'GEN_0634', 'elaphemoellendorffi', 'Elaphe moellendorffi', '(BOETTGER, 1886)', 'Rắn sọc đuôi khoanh', 'SPA_04764', 'là một loài rắn lớn. Con trưởng thành có thể đạt tổng chiều dài (bao gồm cả đuôi) là 1,66 m', NULL, 'Trung Quốc ( Quảng Đông , Quảng Tây ) và Việt Nam ( Hòa Bình ). Nó cũng có thể xảy ra ở Lào ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Elaphe_moellendorffi'),
(4715, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Elaphe', NULL, 'GEN_0634', 'elapheparasina', 'Elaphe parasina', '(Blyth, 1854)', 'Rắn sọc xanh', 'SPA_04765', 'Rắn lành dài tới 1,2m, cơ thể dài mảnh, đầu phân biệt với cổ mắt, mắt tương đối rộng, con ngươi mắt màu vàng, lưỡi đỏ nâu. Môi trên và môi dưới màu vàng nhạt hay màu trắng hơi xanh lá cây. Lưng có màu xanh lá cây sáng. Hai bên tấm vảy bụng thường có một chấm trắng làm cho ta có cảm giác có một sọc màu trắng chạy dọc theo hai bên thân ở phía ngoài gờ bụng và đi tới hai bên khe huyệt (khe hậu môn). Mặt bụng màu trắng hay vàng nhạt.', NULL, 'Trong nước: Lào Cai, Bắc Kạn, Thái Nguyên, Vĩnh Phúc, Gia Lai.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=1&loai=1&ID=5056'),
(4716, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Elaphe', NULL, 'GEN_0634', 'elapheporphyracea', 'Elaphe porphyracea', '(Sauvage, 1876)', 'Rắn sọc đốm đỏ', 'SPA_04767', 'Là phân loài của rắn sọc đốm đỏ Oreocryptophis porphyraceus. Kích thước trung bình, dài khoảng 1 – 1,2m. Đầu dài, phân biệt với cổ. Mặt trung bình, con ngươi tròn. Môi trên gồm 8 vảy và có 2 vảy tiếp giáp với mắt. Vảy bao quanh giữa thân gồm 19 hàng, nhẵn, vảy bụng tròn, vảy hậu môn chia hai, những vảy dưới đuôi xếp thành 2 hàng. Giữa đầu có một đường đen mảnh từ đường tiếp giáp của hai vảy trước trán, đến cuối đường tiếp giáp của 2 vảy đỉnh. Họng và bụng màu vàng nhạt, lưng đỏ nâu, có hai đường đen mảnh chạy song song từ mắt tới mút đuô. Giữa lưng của con non có hàng đốm, to, màu nâu xám, gần tròn, viền sáng, càng về cuối thân càng mờ dần. Loài này thường sống ở bìa rừng dọc theo các sông suối thuộc vùng núi. Thức ăn chủ yếu là các loài lưỡng cư và thú gặm nhấm nhỏ. Vùng phân bố của chúng ở các Vườn quốc gia thuộc phía Đông và Tây bắc như Lạng Sơn, Thái Nguyên, Vĩnh Phúc, Quảng Bình và đã ghi nhận loài này ở Vườn quốc gia Konkakinh thuộc tỉnh Gia Lai.', NULL, ' ', NULL, NULL, 'Là loài rắn có hoa văn rất đẹp, không có độc nên chúng thường bị buôn bán làm vật nuôi cảnh ở Việt Nam và quốc tế. Loài hiếm gặp cần được bảo vệ.', NULL, NULL, NULL, 'vncreatures.net'),
(4717, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Elaphe', NULL, 'GEN_0634', 'elapheprasina', 'Elaphe prasina', '(Blyth, 1854)', 'Rắn sọc xanh', 'SPA_04768', 'Rắn lành dài tới 1,2m, cơ thể dài mảnh, đầu phân biệt với cổ mắt, mắt tương đối rộng, con ngươi mắt màu vàng, lưỡi đỏ nâu. Môi trên và môi dưới màu vàng nhạt hay màu trắng hơi xanh lá cây. Lưng có màu xanh lá cây sáng. Hai bên tấm vảy bụng thường có một chấm trắng làm cho ta có cảm giác có một sọc màu trắng chạy dọc theo hai bên thân ở phía ngoài gờ bụng và đi tới hai bên khe huyệt (khe hậu môn). Mặt bụng màu trắng hay vàng nhạt. Rắn có tập tính leo cây sống ở trung du và miền núi, hoạt động về ban ngày trên những bụi cây hoặc bụi tre gần nước. Con cái đẻ 5 - 8 trứng trong các hốc cây cao hơn mặt đất.', NULL, 'Trong nước: Lào Cai, Bắc Kạn, Thái Nguyên, Vĩnh Phúc, Gia Lai. Thế giới: Ấn Độ, Mianma, Nam Trung Quốc, Bắc Thái Lan, Lào, Malaixia.', NULL, NULL, 'Rắn sọc xanh có giá trị nghiên cứu khoa học và thẩm mỹ.', 'VU', NULL, NULL, 'VnCreature'),
(4718, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Elaphe', NULL, 'GEN_0634', 'elapheradiata', 'Elaphe radiata', 'LAZELL et al. 1999', 'Rắn sọc dưa', 'SPA_04769', 'Rắn lành, cỡ lớn trong họ rắn nước colubride, dài tới 2m, Đầu tương đối nhỏ thuôn dài, màu nâu xám phân biệt rõ với cổ. Lưng có màu nâu xám, có bốn đường màu đen chạy từ gáy xuống tới quá nửa thân, hai đường giữa to chạy dài liên tục, hai đường bên cạnh nhỏ hơn và đứt đoạn. Có một đường chạy ngang qua gáy. Từ mắt có ba đường đen nhỏ, hai đường chạy xiên xuống môi trên còn một đường qua thái dương nối với vòng đen ở gáy. ', NULL, ' ', NULL, NULL, NULL, 'VU', NULL, NULL, 'Hệ thống thông tin, cơ sở dữ liệu môi trường tỉnh Bắc Kạn'),
(4719, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Elaphe', NULL, 'GEN_0634', 'elaphetaeniura', 'Elaphe taeniura', '(COPE, 1861)            ', 'Rắn sọc đuôi', 'SPA_04770', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4720, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Enhydris', NULL, 'GEN_0648', 'enhydrisbocourti', 'Enhydris bocourti', '(Jan, 1865)', 'Rắnh bồng voi', 'SPA_04771', 'Cơ thể dài xấp xỉ 1m. Thân mập. Đầu phân biệt với cổ. Mắt nhỏ, ở mặt trên đầu, con ngươi hình bầu dục đứng. Lỗ mũi có nếp da che, ở mặt trên đầu. Vảy thân từ 25 - 29 hàng. Đầu màu xám nhạt. Môi, họng và bụng màu trắng đục. Lưng xanh ánh màu đá, có nhiều sọc xám nhạt, mảnh chạy dọc lưng. ở sườn có hàng vệt xám đen to chạy từ lưng tới gần giữa bụng, xếp so le nhau. Rắn sống dưới nước, gặp nhiều ở đồng bằng Nam bộ. Ăn các loài cá nhỏ kể cả cá vàng, ếch nhái; là loài rắn đẻ con trứng đẻ tới 17 con.', NULL, 'Bình Dương, Tây Ninh, Đồng Nai, Thành phố Hồ Chí Minh, Kiên Giang, Sóc Trăng, Cần Thơ, Cà Mau. Thái Lan, Malaixia, Cămpuchia.', NULL, NULL, 'Có giá trị nghiên cứu khoa học, giúp cân bằng sinh thái trong tự nhiên', 'VU', NULL, NULL, 'vncreatures.net'),
(4721, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Enhydris', NULL, 'GEN_0648', 'enhydrischinensis', 'Enhydris chinensis', '(Gray, 1842)            ', 'Rắn bồng trung quốc', 'SPA_04772', ' là một loài rắn tương đối nhỏ có tổng chiều dài (bao gồm cả đuôi) lên tới 8 cm.', NULL, 'được tìm thấy ở Trung Quốc, Đài Loan và Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.gbif.org/species/165661432'),
(4722, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Enhydris', NULL, 'GEN_0648', 'enhydrisenhydris', 'Enhydris enhydris', '(SCHNEIDER, 1799)', 'Rắn bông súng', 'SPA_04773', 'Loài rắn có chiều dài trung bình này có đầu nhiều màu, không rõ rệt. Thân hình trụ có vảy trơn láng. Phía trên thân có màu xám hoặc màu ôliu với những sọc kẻ màu nâu trên sống lưng và những sọc nhạt hơn tách biệt bởi các lằn đen nhuyễn ở mỗi bên. Đầu màu nâu với những cặp đường kẻ màu nhạt hướng về phía mõm. Bụng màu trắng hoặc vàng với một đường nằm ở chính giữa sậm màu hoặc một dãy chấm tròn. Thức ăn của chúng chủ yếu là cá. Con cái mỗi lứa đẻ từ 4 - 18 con. Rắn con dài 14cm giống rắn trưởng thành. Chúng là loài rắn hiền lành hoạt động ban ngày và được thấy ở những nơi nước ngọt đất trũng, ao hồ, đầm lầy.', NULL, 'Từ Phú yên trở vào đến Minh Hải đều có loài này phân bố. Hầu hết cư trú tại các vùng nhiệt đới phía Đông nam châu Á, bao gồm phía Nam Thái Lan 170 Bắc, bán đảo Mã Lai và Singapore.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4723, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Enhydris', NULL, 'GEN_0648', 'enhydrisinnominata', 'Enhydris innominata', '(Morice, 1875)', 'Rắn bồng không tên ', 'SPA_04774', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4724, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Enhydris', NULL, 'GEN_0648', 'enhydrisjagori', 'Enhydris jagori', '(PETERS, 1863)', 'Rắn bồng gia gô', 'SPA_04775', 'Loài răn khá nhỏ này phía trên có màu xám nhạt hoặc xanh ôliu với các đốm màu đen nhạt luôn được sắp xếp theo cặp trên đường sống lưng và các đốm có cạnh ở bên hông. Phần bụng và phía ngoài bụng có ba hoặc bốn hàng vảy màu vàng, hồng, hoặc trắng nhạt; mép ngoài của phần bụng và các hàng vảy tiếp giáp có viền màu xám. Phần trên đầu màu xám và hơi khác biệt. Thân hình bầu dục, kích thước tăng lên về phía sau; vảy trơn láng. Chiều dài thân khoảng 70cm', NULL, 'Việt Nam: Kontum, Tây Ninh, thành phố Hồ Chí Minh, Sóc Trăng, Minh Hải', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=1&loai=1&img=1&ID=5021'),
(4725, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Enhydris', NULL, 'GEN_0648', 'enhydrisplumbea', 'Enhydris plumbea', '(Boie, 1827)            ', 'Rắn bồng chì', 'SPA_04776', 'Chiều dài cơ thể khoảng 56 - 60cm, mập tròn. Đầu hơi dẹt, hơi phân biệt với cổ, lỗ mũiở mặt trên đầu, có lớp da che. Mặt nhỏ nằm ở phần trên đầu, mắt hình bầu dục đứng. Môi trên có 8 vảy (có thể 9, nhưng rất hiếm). Vảy bao quanh giữa thân gồm 19 hàng (đôi khi 17), nhẵn. Vảy bụng rộng, tròn, vảy hậu môn chia hai, những vảy dưới đuôi xếp thành 2 hàng. Thân hình trụ hay hình bầu dục, ngắn và to chắc, vảy trơn láng.có màu ôliu xám nhạt hay xám lam về phía trên và chuyển đột ngột sang màu vàng ở phía dưới về phía hông, đuôi. Mặt trên bụng trắng đục hoặc vàng nhạt có những chấm tròn đen ở giữa. ở một số cá thể phần phía dưới đuôi có một đường đen ngay giữa Đây là loài hoạt động suốt ngày đêm, thức ăn chủ yếu là ăn cá và ếch nhái. Mỗi lứa đẻ từ 6 - 30 con trứng, rắn con dài 8 - 13cm có màu giống như rắn truởng thành. Loài rắn này thường bắt gặp ở vùng ao, hố, đầm lầy nước ngọt, còn gặp ở độ cao tới 1.200m.', NULL, 'Việt Nam: Từ Bắc tới Nam và phố biến nhất là vùng đồng bằng Nam bộ Thế giới: Loài này có mặt trên khắp Đông nam châu Á như Thái Lan, lào, Cambodia, Mianma, Malaysia, Philippin.', NULL, NULL, NULL, NULL, NULL, NULL, 'Vn Creature'),
(4726, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Enhydris', NULL, 'GEN_0648', 'enhydrissubtaeniata', 'Enhydris subtaeniata', '(Bourret, 1934).', 'Rắn bù lịch ', 'SPA_04777', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4727, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Euprepiophis', NULL, 'GEN_0692', 'euprepiophismandarinus', 'Euprepiophis mandarinus', '(Cantor, 1842)', 'Rắn sọc quan', 'SPA_04778', 'Rắn lành, dài khoảng 1m. Đầu không phân biệt rõ với cổ. Lưng màu hồng điều, chính giữa cổ và lưng có một dãy hình quả trám mầu đen, ở giữa có vết màu vàng nằm ngang. Có một vết màu xám đen chạy ngang qua mõm, một vết thứ hai chạy ngang đỉnh đầu qua hai mắt, một vết thứ ba làm thành hình L ở gáy. Bụng màu vàng có những vết to màu xám đen nằm ngang so le với nhau.', NULL, ' Lai Châu, Lào Cai, Sơn La, Lạng Sơn, Vĩnh Phúc, Hà Tĩnh.', NULL, NULL, 'Có giá trị bảo vệ thực vật (chủ yếu ăn chuột), thẩm mỹ (có hoa văn, màu sắc đẹp). Rắn sọc quan cỡ lớn được nuôi làm cảnh trong vườn thú để giáo dục môi trường đối với học sinh, sinh viên.', NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=5&loai=1&img=1&ID=5012'),
(4728, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Fordonia', NULL, 'GEN_0719', 'fordonialeucobalia', 'Fordonia leucobalia', '(Schlegel, 1837).', 'Rắn phô đôn', 'SPA_04779', 'Môi trên 5 hoặc 6, thứ ba đi vào quỹ đạo; loreal thường vắng mặt; vảy ở dạng tấm vòng mắt; trán phía trước ngắn hơn vảy đỉnh; răng nanh phía sau chắc khỏe, có rãnh, mặt lưng có hoa văn đồng nhất màu xám đá phiến hoặc lốm đốm các màu đỏ, nâu, đen và trắng (hoặc sự kết hợp nào đó của các màu này) (MURPHY & VORIS 2014). ', NULL, 'Úc (Lãnh thổ phía Bắc, Queensland, Tây Úc) Bangladesh; Ấn Độ (Bengal); Indonesia (Borneo, Irian Jaya, Seram = Ceram, Sumatra, Java; Timor, Ambon); Timor-Leste, Malaysia (Malaya và ĐôngMalaysia); Myanmar (Miến Điện), Papua New Guinea Philippines (Mindanao); Singapore; Thái Lan, Campuchia, Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'https://reptile-database.reptarium.cz/species?genus=Fordonia&species=leucobalia'),
(4729, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Fowlea', NULL, 'GEN_0722', 'fowleaflavipunctatus', 'Fowlea flavipunctatus', '(Hallowell, 1860) ', 'Rắn nước', 'SPA_04780', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4730, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Fowlea', NULL, 'GEN_0722', 'fowleapiscator', 'Fowlea piscator', '(Schneider, 1799)', 'Rắn nước ', 'SPA_04781', 'Mắt của F. piscator khá nhỏ và ngắn hơn khoảng cách từ lỗ mũi ở con trưởng thành. Quy mô rostral của nó có thể nhìn thấy từ trên cao. Các vảy trong mũi hẹp nhiều về phía trước và dưới hình tam giác, góc trước cụt và dài bằng vảy trước trán. Vây trán dài hơn khoảng cách tính từ cuối mõm và dài bằng vảy đỉnh hoặc ngắn hơn một chút. Loreal dài gần bằng độ sâu. Có một thị kính trước và ba (hiếm khi bốn) sau thị kính. Thời gian của nó là 2+2 hoặc 2+3. Thông thường có chín môi trên , với môi thứ tư và thứ năm đi vào mắt; và năm môi dưới tiếp xúc với phần cằm trước, ngắn hơn phần sau. Các vảy lưng xếp thành 19 hàng, có gờ chắc chắn, các hàng ngoài nhẵn. Số vây bụng là 125–158, số vây hậu môn là 64–90. Màu sắc rất khác nhau, bao gồm các đốm đen sắp xếp theo thứ tự ngũ sắc và thường được phân tách bằng mạng lưới màu trắng, hoặc các dải dọc màu đen trên nền đất nhợt nhạt, hoặc các dải chéo sẫm màu, có hoặc không có các đốm trắng. Hai vệt đen xiên, một ở dưới và một ở sau mắt, gần như không đổi. Phần dưới có màu trắng, có hoặc không có viền đen ở các tấm chắn', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Checkered_keelback'),
(4731, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Gonyosoma', NULL, 'GEN_0784', 'gonyosomaboulengeri', 'Gonyosoma boulengeri', '(MOCQUARD, 1897)', 'Rắn vòi', 'SPA_04782', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4732, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Gonyosoma', NULL, 'GEN_0784', 'gonyosomaoxycephalum', 'Gonyosoma oxycephalum', '(Boie, 1827)            ', 'Rắn đuôi đỏ', 'SPA_04783', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4733, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Gonyosoma', NULL, 'GEN_0784', 'gonyosomaprasinum', 'Gonyosoma prasinum', '(Blyth, 1854)            ', 'Rắn sọc xanh', 'SPA_04784', 'Rắn lành dài tới 1,2m, cơ thể dài mảnh, đầu phân biệt với cổ mắt, mắt tương đối rộng, con ngươi mắt màu vàng, lưỡi đỏ nâu. Môi trên và môi dưới màu vàng nhạt hay màu trắng hơi xanh lá cây. Lưng có màu xanh lá cây sáng. Hai bên tấm vảy bụng thường có một chấm trắng làm cho ta có cảm giác có một sọc màu trắng chạy dọc theo hai bên thân ở phía ngoài gờ bụng và đi tới hai bên khe huyệt (khe hậu môn). Mặt bụng màu trắng hay vàng nhạt. Rắn có tập tính leo cây sống ở trung du và miền núi, hoạt động về ban ngày trên những bụi cây hoặc bụi tre gần nước. Con cái đẻ 5 - 8 trứng trong các hốc cây cao hơn mặt đất.', NULL, 'Trong nước: Lào Cai, Bắc Kạn, Thái Nguyên, Vĩnh Phúc, Gia Lai. Thế giới: Ấn Độ, Mianma, Nam Trung Quốc, Bắc Thái Lan, Lào, Malaixia.', NULL, NULL, 'Rắn sọc xanh có giá trị nghiên cứu khoa học và thẩm mỹ.', 'VU', NULL, NULL, 'Vn Creature'),
(4734, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Hebius', NULL, 'GEN_0827', 'hebiusbitaeniatum', 'Hebius bitaeniatum', '(Wall, 1925)', 'Rắn sãi kut-kai', 'SPA_04785', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4735, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Hebius', NULL, 'GEN_0827', 'hebiusboulengeri', 'Hebius boulengeri', '(GRESSITT, 1937)', '  ', 'SPA_04786', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4736, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Hebius', NULL, 'GEN_0827', 'hebiuschapaensis', 'Hebius chapaensis', 'Bourret, 1934            ', 'Rắn bình mũi sa pa', 'SPA_04787', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4737, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Hebius', NULL, 'GEN_0827', 'hebiuskhasiense', 'Hebius khasiense', '(BOULENGER, 1890)', 'Rắn sãi khasi', 'SPA_04788', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4738, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Hebius', NULL, 'GEN_0827', 'hebiussauteri', 'Hebius sauteri', '(Boulenger, 1909)', 'Rắn sãi sau te', 'SPA_04789', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4739, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Homalopsis', NULL, 'GEN_0896', 'homalopsisbuccata', 'Homalopsis buccata', '(Linnaeus, 1758)            ', 'Rắn ri cá ', 'SPA_04790', 'Rắn dài gần 1m, nặng khoảng 6 lạng có nhiều khoanh tròn từ đầu đến đuôi, đặc biệt trên đầu có chấm màu đen mũi tên, dưới bụng có nốt màu đen như nốt ruồi. Chúng được nhận biết ngay lập tức bởi cái đầu to rộng. Thân to, chắc, hình trụ với các vảy gồ lên. Trên đỉnh đầu có những hoa văn như hình mặt nạ màu trắng. Thân màu nâu đỏ nhạt với nhiều vạch ngang màu vàng nhạt viền đen, nhưng nhạt dần sang màu nâu xám ở các con rắn già. Phần bụng màu trắng có những chấm tròn đen nhỏ. Rắn con có màu đen và vạch trắng.\nLoài rắn ri cá sinh sống chủ yếu ở miền sông nước ở miền nam và không nguy hiểm cho người dân khi bị rắn này cắn. Thịt rắn ri cá ăn ngon. Thức ăn chính của loài này là cá và ếch nhái. Con cái mỗi lứa đẻ từ 2 - 20 con, rắn con dài khoảng 23 cm. Là loài ăn đêm và sống bán thời gian dưới nước, nó cư trú ven sông nước ngọt, ao hồ, kênh lạch và các đầm lầy.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/R%E1%BA%AFn_ri_c%C3%A1'),
(4740, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Homalopsis', NULL, 'GEN_0896', 'homalopsismereljcoxi', 'Homalopsis mereljcoxi', 'MURPHY, VORIS, MURTHY, TRAUB & CUMBERBATCH, 2012', 'Rắn ri came-rin-j-cox', 'SPA_04791', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4741, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Liopeltis', NULL, 'GEN_1088', 'liopeltisfrenatus', 'Liopeltis frenatus', '(Günther, 1858)', 'Rắn đai má', 'SPA_04792', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4742, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Liopeltis', NULL, 'GEN_1088', 'liopeltismajor', 'Liopeltis major', 'Stejneger, 1907', NULL, 'SPA_04793', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4743, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Lycodon', NULL, 'GEN_1125', 'lycodonfasciatus', 'Lycodon fasciatus', '(Anderson, 1879)            ', 'Rắn khuyết cạp nong', 'SPA_04794', 'Con trưởng thành có thể đạt tổng chiều dài 53 cm, với đuôi dài 11 cm .\nMàu sắc của nó bao gồm các vòng rộng màu đen tía bao quanh cơ thể và được phân tách bằng các khoảng màu hơi vàng hoặc hơi đỏ. Vòng đen đầu tiên không bao quanh cổ.\nCác vảy lưng xếp thành 17 hàng, hơi cong về phía trước, các vảy trở nên rõ hơn ở phía sau. Vây bụng là 205-213; hậu môn là toàn bộ; và số phần dưới đuôi được chia là 77-90. ', NULL, ' Nó được tìm thấy ở Ấn Độ (Assam), Bangladesh, Myanma, Thái Lan, Lào, Việt Nam, Tây Tạng, Tây Nam Trung Quốc (từ Vân Nam và Quảng Tây đến Hồ Bắc, phía bắc đến Thiểm Tây và Cam Túc, Phúc Kiến, Tứ Xuyên).', NULL, NULL, NULL, NULL, NULL, NULL, 'Thainationalparks'),
(4744, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Lycodon', NULL, 'GEN_1125', 'lycodonfutsingensis', 'Lycodon futsingensis', '(Pope, 1928)            ', 'Rắn lệch đầu fut sing', 'SPA_04795', 'Dải màu đen và trắng hoặc đôi khi có màu hồng hoặc xám và có hình dáng rất giống với Eo biển nhiều dải . Dải dải nhìn chung có độ tương phản thấp hơn so với trên Many Banded Krait . Các dải cũng có xu hướng giữ nguyên khoảng cách đồng đều theo chiều dài của cơ thể và cũng không đều với các cạnh không đều nhau. Đầu lớn hơn cổ khiến nó lớn hơn đầu của nhiều loài Kraits. Đạt chiều dài ~ 80cm. Hoạt động về đêm và chủ yếu săn thằn lằn. Nhìn chung ngoan ngoãn khi đến gần, chúng không nhanh chóng cắn nhưng sẽ cắn như vậy nếu bị quấy rầy hoặc bị xử lý. Thường chậm chạp và thận trọng khi di chuyển, chúng có khả năng di chuyển nhanh khi chạy trốn. Săn gần nguồn nước, nền rừng và ống dẫn nước. Thường được tìm thấy ở độ cao cao hơn tới 700+m. Có khả năng tiết ra xạ hương rất mạnh từ tuyến hậu môn như một biện pháp phòng thủ. Rắn sói Futsing là loài sống trên cạn thường săn mồi ở các khu vực rừng rậm hoặc cống dẫn nước ở những nơi có độ cao lớn hơn. Nó cực kỳ hiếm ở Hồng Kông. Một cuộc chạm trán ít phổ biến hơn đối với hầu hết do tính chất hiếm gặp và hoạt động về đêm của nó, mặc dù rất khó có khả năng va vào một con trên đường mòn và nếu vậy thì chúng nên tránh xa và để yên do có ngoại hình tương tự với Eo biển nhiều dải chết chóc ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Hongkongsnakeid'),
(4745, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Lycodon', NULL, 'GEN_1125', 'lycodonlaoensis', 'Lycodon laoensis', 'Günther, 1864            ', 'Rắn khuyết lào', 'SPA_04796', 'Về mặt lưng, nó có màu nâu sẫm, với một dải chéo màu trắng hoặc hơi vàng ở chẩm và các dải chéo trên cơ thể tương tự chia đôi ở hai bên. Ở phần bụng có màu trắng. Con trưởng thành có tổng chiều dài khoảng 0,5 m, bao gồm cả đuôi khoảng 10 cm. ', NULL, ' Nó được tìm thấy ở Ấn Độ, Thái Lan, Lào, Việt Nam, Campuchia, Trung Quốc (Vân Nam) và Tây Malaysia.', NULL, NULL, NULL, NULL, NULL, NULL, 'Thainationalparks'),
(4746, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Lycodon', NULL, 'GEN_1125', 'lycodonmeridionalis', 'Lycodon meridionalis', '(BOURRET, 1935)', 'Rắn lệch đầu kinh tuyến', 'SPA_04797', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4747, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Lycodon', NULL, 'GEN_1125', 'lycodonrufozonatus', 'Lycodon rufozonatus', 'Cantor, 1842', 'Rắn khuyết hoa/lệch đầu hoa', 'SPA_04799', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4748, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Lycodon', NULL, 'GEN_1125', 'lycodonruhstrati', 'Lycodon ruhstrati', '(Fischer, 1886)            ', 'Rắn khuyết đài loan', 'SPA_04800', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4749, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Lycodon', NULL, 'GEN_1125', 'lycodonsubcinctus', 'Lycodon subcinctus', 'Boie, 1827            ', 'Rắn khuyết đai', 'SPA_04801', 'Rắn khuyết khoanh là loài thay đổi hoa văn trên cơ thể của chúng theo tuổi. Các con nhỏ có tới 20 khoanh màu trắng nhưng khi chúng trưởng thành thì các khoanh màu này từ từ biến mất, những khoanh trắng phía sau nhạt đi trước. Con lớn màu nâu đậm hoặc màu đen với những khoanh màu trắng rộng. Phần phía trước sẽ trở nên sậm màu hơn cho tới khi phần sau của thân chuyển sang màu đen đồng nhất. Loài này trông giống loài rắn độc Bungarus candidus, nhưng nó có vảy hơi gồ. Sống lưng không rộng và vảy nằm trong dải màu trắng không có viền đen. Loài này thường sống ở các khu vực khô ráo, và đã gặp ở độ cao trên 1.770m. Là loài ăn đêm và sống trên cạn, thức ăn chủ yếu của chúng được biết đến là thạch sùng và thằn lằn bóng chân ngắn; đôi khi chúng còn ăn ếch nhái và các loài chim, thú nhỏ khác. Con cái đẻ 5 - 11 trứng và trứng nở sau 10 - 12 tuần ấp; rắn con dài khoảng 24cm.', NULL, 'Việt Nam: Cao Bằng (Ngân Sơn, Lai Châu (Mường Tè, Hà Tây (Ba Vì, Tòng, Thanh Hoá (Quan Hoá, Tây Ninh, Đồng Nai Thế giới: Nó có mặt hầu hết trên khắp Đông nam châu Á như Thái Lan, Myanma, Lào, Cambodia.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4750, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Myrrophis', NULL, 'GEN_1281', 'myrrophisbennetti', 'Myrrophis bennetti', '(GRAY, 1842)', 'Rắn bồng chì nước lợ', 'SPA_04802', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4751, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Myrrophis', NULL, 'GEN_1281', 'myrrophischinensis', 'Myrrophis chinensis', '(GRAY, 1842)', 'Rắn bồng trung quốc', 'SPA_04803', 'Nhỏ 30-50cm. Thân màu xanh ô liu, các mảng nhỏ màu đen, sọc hồng/cam ở hai bên dưới, mắt trên đỉnh đầu Thủy sinh, sẽ tấn công dễ dàng và xạ hương nếu được xử lý, có khả năng nhảy vọt. Hoạt động chủ yếu vào ban đêm', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Hongkongsnakeid'),
(4752, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Natrix', NULL, 'GEN_1291', 'natrixpiscater', 'Natrix piscater', '(Hallowell, 1861)', 'Rắn nước', 'SPA_04804', 'Đầu thuôn dài phân biệt với cổ. Mắt bé, con ngươi tròn. Lỗ mũi nằm giữa tấm mũi chia. Có hai tấm gian mũi bé hơn hai tấm trước trán; tấm trán dài hơn gấp 2 lần rộng, dài hơn khoảng cách từ nó đến mút mõm; hai tấm đỉnh lớn. Có một tấm má rộng bằng cao, một tấm trước mắt cao, phân cách tấm trán bởi tấm trên mắt. Ba tấm sau mắt, hai tấm dưới mắt, tấm thứ hai phân cách mắt với tấm mép trên thứ 6. Vảy thái dương 2+2, dài và nhẵn. Tấm cằm hình tam giác, đường viền của tấm cằm bé hơn tấm mõm. Có 2 cặp tấm cằm sau, cặp thứ nhất tiếp xúc nhau hoànn toàn và ngắn hơn cặp thứ hai.\n\nCó 9 tấm mép trên, một phần tấm thứ 4 và tấm thứ 5 chạm mặt, 10 tấm mép dưới, cặp tấm đầu tiên chạm nhau sau tấm cằm, 5 tấm tiếp xúc với tấm sau cằm thứ nhất ở mỗi bên. Có 19 hàng vảy thân có gờ trừ hai hàng ngoài cùng nhẵn. 137 vảy bụng, 71 vảy dưới đuôi. Tấm hậu môn chia\nChiều dài thân 558mm, chiều dài đuôi 210mm, SV = 9, IL =10, C = 19, V = 137, SC = 71. Thân màu nâu xám, có các vân đen ngang ở trên và bên lưng, đôi khi xen kẽ các vệt nâu đỏ nhạt. mặt trên đầu sẫm hơn, có hai vệt đen từ mắt tới các tấm mép trên thứ 6 và thứ 8, một vệt đen khác từ sau góc hàm đến gáy. Bụng màu trắng đục, mép trước của tấm bụng thường có viền đen.\nSinh học, sinh thái:\nRắn nước săn các con mồi gồm cá và chuột làm thức ăn. Loài này đẻ rất nhiều: đã từng được ghi nhận là có những ổ trứng lên đến 100 trứng, mặc dù mức độ bình thường là 17 - 52 trứng. Thời gian ấp trúng từ năm đến bảy tuần, rắn con dài 15 - 21cm. Loài rắn sống trên cạn phổ biến này hoạt động suốt ngày đêm, sống ở ao hồ, suối, các cánh đồng lúa và các vùng nước ngọt ở độ cao tới 1.600m', NULL, 'Việt Nam: Loài này phân bố rất rộng chúng hầu như có từ Bắc đến Nam và có rất nhiều ở đồng bằng sông Cửu Long\n\nThế giới: Thái Lan, Cambodia, Lào, Trung Quốc, Malaixia, Ấn Độ, Nêpan.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=1&loai=1&img=1&ID=5009'),
(4753, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Oligodon', NULL, 'GEN_1366', 'oligodonalbocinctus', 'Oligodon albocinctus', '(Cantor, 1839)', 'Rắn khiếm', 'SPA_04805', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4754, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Oligodon', NULL, 'GEN_1366', 'oligodoncattienensis', 'Oligodon cattienensis', 'Vassilieva, Geissler, Galoyan, Poyarkov Jr, Van Devender & Böhme, 2013', 'Rắn khiếm cát tiên', 'SPA_04806', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4755, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Oligodon', NULL, 'GEN_1366', 'oligodonchinensis', 'Oligodon chinensis', '(Günther, 1888)            ', 'Rắn khiếm trung quốc', 'SPA_04807', 'Dài thân 480 mm ở con đực và 519 mm ở con cái. Dài đuôi 89 mm ở con đực và 90 mm ở con cái. Vảy môi trên 8 (công thức 3 - 2 - 3), ít hơn thì có 7 (công thức 3 - 2 - 2) hoặc 6 (với hai công thức 1 - 2 - 3 hoặc 2 - 2 - 2). Vảy môi dưới 8 (hoặc 7), trong đó 4 (hoặc 2 hay 3 hoặc 5) phía trước chạm vảy cằm. Vảy má 1. Vảy trước mắt 1 (hoặc 2). Vảy sau mắt 2. Vảy thái dương 2 (hoặc 1) + 2. Hàng vảy lưng 17 - 17 - 15, trơn láng. Vảy bụng 174 - 183 ở con đực và 168 - 206 ở con cái. Lỗ huyệt phân đôi. Vảy dưới đuôi 48 - 63 cặp ở con đực và 45 - 60 ở con cái. Vảy môi hình tam giác, rộng hơn cao, từ phía trên có thể nhìn thấy một phần. Vảy gian mũi xiên, rộng hơn dài rất nhiều. Vảy trước trán hình sáu cạnh ,lớn hơn vảy gian mũi, rộng bằng vảy đỉnh. Lưng màu be xám nhạt, ở giữa có sọc dọc lúc màu đỏ lúc màu be nhạt. Mặt lưng có 11 - 15+3 - 5 vằn ngang màu be đen, giữa các vòng vằn có xem vằn đen. Giữa hai mắt phần đầu có một vết đen loang đến vảy môi trên. Phần cổ có một vằn mũi mác rõ. Bụng màu trắng xám, có đốm đen không quy luật. Ở giữa sau thân có một sọc ngang màu đỏ không rõ. Mặt dưới của đuôi màu hồng phấn. Cơ quan bán dục đực phân hình chéo. Lộn ra ngoài có hình chữ Y. Mỗi một nhánh có một cặp xương tuyến nhọn.\n\nSinh học, sinh thái:\n\nSống cả ở dưới đất và trên cây ở các khu rừng thường xanh ở độ cao trung bình. Thức ăn là những loài bò sát, lưỡng cư sống trong khu vực phân bố. Kiếm ăn ban đêm, ban ngày nghỉ ngơi trên cành cây.', NULL, 'Trong nước: Loài này chỉ gặp ở các tỉnh phía Bắc Việt Nam (Hòa Bình, Lào Cai - Vườn quốc gia Hoàng Liên, Phú Thọ - Vườn quốc gia Xuân Sơn).\n\nNước ngoài: Trung Quốc (Vân Nam).', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=6&loai=1&img=1&ID=6112'),
(4756, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Oligodon', NULL, 'GEN_1366', 'oligodoncinereus', 'Oligodon cineraeus', '(Günther, 1864)', 'Rắn kiếm xám', 'SPA_04808', 'Màu nâu nhạt, phía trên có màu đỏ tía hoặc hơi đỏ; dấu hiệu trên đầu rất rõ ràng; đồng phục trên và dưới. Tổng chiều dài 30 inch; đuôi 3', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4757, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Oligodon', NULL, 'GEN_1366', 'oligodoncyclurus', 'Oligodon cyclurus', '(Cantor, 1839)', 'Rắn khiếm đuôi vòng', 'SPA_04809', 'có 21 hoặc 23 hàng vảy ở giữa thân. O. fasciolatus trước đây được đồng nghĩa với O. cylurus có 19 hàng vảy và bị giới hạn ở Ấn Độ, Bangladesh và Myanmar fide PAUWELS et al. 22.', NULL, 'SE Myanmar, Thái Lan, Campuchia, Lào, Việt Nam, Trung Quốc (Vân Nam)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://reptile-database.reptarium.cz/species?genus=Oligodon&species=fasciolatus'),
(4758, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Oligodon', NULL, 'GEN_1366', 'oligodondeuvei', 'Oligodon deuvei', '(David, Vogel & Van Rooijen, 2008)', 'Rắn khiếm deu-vơ', 'SPA_04810', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4759, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Oligodon', NULL, 'GEN_1366', 'oligodoneberhardti', 'Oligodon eberhardti', 'Pellegrin, 1910            ', 'Rắn khiếm', 'SPA_04811', 'Tổng chiều dài khoảng 0,5 mét. Đầu ngắn và nhỏ, không thể phân biệt được với cổ. Có 6 (2-2-2) vảy môi trên, không có vảy má, 1 vảy quỹ đạo trước và sau, và 1 + 2 vảy thái dương. Vảy lưng có tất cả 13 hàng, nhẵn; vảy bụng 166-186, vảy hậu môn 2 và vảy đuôi dưới 33-39 đôi. Lưng màu nâu đỏ hoặc nâu đỏ, có một hàng đốm hình thoi màu nâu đỏ từ cổ đến đường giữa đuôi, các hình ghép xếp thành hình lưới, mặt dưới đuôi chủ yếu là san hô. màu sắc, rất đẹp. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'UBND tinh Bac Kan'),
(4760, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Oligodon', NULL, 'GEN_1366', 'oligodonfasciolatus', 'Oligodon fasciolatus', '(Günther, 1864)', 'Rắn khiếm đuôi vòng', 'SPA_04812', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4761, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Oligodon', NULL, 'GEN_1366', 'oligodonformosanus', 'Oligodon formosanus', '(Günther, 1872)', 'Rắn khiếm đài loan', 'SPA_04813', 'Màu vàng mù tạt đến nâu nhạt với các đốm màu đen và nâu hình dạng không đều và đôi khi có sọc Có khả năng thực hiện những cú chém bằng răng cắt trứng phía sau, sẽ sẵn sàng tấn công nếu bị xử lý. Hoạt động vào ban đêm', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Hongkongsnakeid'),
(4762, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Oligodon', NULL, 'GEN_1366', 'oligodonocellatus', 'Oligodon ocellatus', '(Morice, 1875)', 'Rắn khiếm vằn đen', 'SPA_04814', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4763, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Oligodon', NULL, 'GEN_1366', 'oligodonsinereus', 'Oligodon sinereus', '(GÜNTHER, 1864)', 'Rắn khiếm xám', 'SPA_04815', 'à một loài có hình thái thay đổi, Oligodon cinereus có nhiều kiểu hình lưng khác nhau (xem Smith 1943), được sử dụng làm cơ sở để mô tả một số phân loài. Tuy nhiên, phân loại nội loài hiện tại của loài này vẫn chưa được giải quyết. Wagner (1975) đã chỉ ra trong luận án thạc sĩ chưa được xuất bản của mình rằng sự khác biệt giữa các phân loài khác nhau là không rõ ràng. Wagner đã hạn chế chấp nhận các phân loài, một quan điểm đã được DAVID và cộng sự tuân theo. 211', NULL, 'Ấn Độ (Assam; Arunachal Pradesh [A. Captain, pers. comm.], Mizoram), Bangladesh, Bhutan, Campuchia, Lào, Việt Nam (Bình Thuận, v.v.), Myanmar (= Miến Điện), Thái Lan, Tây Bắc Malaysia, Trung Quốc ( về phía tây đến Vân Nam, bao gồm Hồng Kông và Hải Nam, Quảng Tây, Phúc Kiến, Quảng Đông, Hồng Kông)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://reptile-database.reptarium.cz/species?genus=Oligodon&species=cinereus'),
(4764, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Oligodon', NULL, 'GEN_1366', 'oligodonsp', 'Oligodon sp.', NULL, 'Rắn khiếm sp', 'SPA_04816', 'Các loài rắn của chi Oligodon là những động vật bò sát ăn trứng và thường có chiều dài dưới 9 cm (35 inch). Các loài thể hiện các kiểu màu và sọc không giống nhau. sinh sống chủ yếu nhờ việc lùng sục trứng chim và bò sát. Ngoài trứng ra, chúng cũng ăn cả thằn lằn, ếch nhái và các loài động vật gặm nhấm nhỏ.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Chi_R%E1%BA%AFn_khi%E1%BA%BFm'),
(4765, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Oligodon', NULL, 'GEN_1366', 'oligodontaeniatus', 'Oligodon taeniatus', '(Gunter, 1861)            ', 'Rắn khiếm vạch', 'SPA_04817', 'Loài rắn nhỏ đẹp mã này có thân màu xám chuyển sang nâu với hai hàng sọc nhỏ màu nâu đậm bên hông dọc theo sống lưng. Sống lưng màu sáng và có những đốm vàng nhỏ. Không có đốm màu đậm trên bề mặt của đuôi. Một dải màu nâu đậm, rộng kéo dài tới mõm, qua mắt, tới trên mép. Một dải khác chạy từ đỉnh đầu tới chân hàm, nhưng không đụng tới các vảy bụng. Cằm màu trắng, bụng màu đỏ cam nhạt có những vết hình tứ giác màu đen không đồng đều, những dấu lớn nhất và hiện nhiều nơi gần hậu môn. Loài rắn săn mồi ban đêm trên mặt đất ở nhiều kiểu sinh cảnh khác nhau. Từ vùng thường xanh cho đến các khu vực đất nông nghiệp hay các khu vực đô thị hoang hóa. Thức ăn là các loài ếch nhái, thú gặm nhấm nhỏ, đôi khi chúng ăn cả trứng chim.', NULL, 'Việt Nam: Bắc Thái, Ninh Bình (Cúc Phương, Nghệ An, Lâm Đồng (Đà Lạt, Khánh Hoà (Nha Trang, Tây Ninh, Đồng Nai (Định Quán, Tiền Giang, Mỹ Tho, Sóc Trăng, Bà Rịa – Vũng Tàu (Côn Đảo) Thế giới: Loài này phân bố tập trung nhiều ở Thái Lan, Trung Quốc (Vân Nam) nó còn có ở Lào, Cambodia.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4766, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Opisthotropis', NULL, 'GEN_1385', 'opisthotropisjacobi', 'Opisthotropis jacobi', 'ANGEL & BOURRET, 1933', 'Rắn trán gia cốp', 'SPA_04818', 'chiều dài là 540 mm + 145 mm. 8 (3-2-3) hoặc 9 (3-2-4) vảy môi trên; 1 vảy má, không có vảy giữa mũi; 1 vảy trước, sau và trên hốc mắt, vảy thái dương 1 mảnh + 1 mảnh. Vảy lưng nhẵn, có 15 hàng trên cơ thể; vảy bụng là 159-179 và vảy đuôi dưới là 69-90 cặp. Mặt lưng và mặt bụng có màu đen, nhấp nháy, và các rìa vảy của vảy bụng và vảy đuôi dưới có màu nhạt. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'UBND tinh Bac Kan'),
(4767, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Opisthotropis', NULL, 'GEN_1385', 'opisthotropislateralis', 'Opisthotropis lateralis', '(Boulenger,1903)', 'Rắn trán bên', 'SPA_04819', 'Thân màu xanh ô liu hoặc nâu có sọc đen mờ ở phía sau và mặt dưới màu vàng hoặc nâu, đầu tròn nhỏ, dài 30-40 cm khi trưởng thành. Di chuyển chậm và rất ngoan ngoãn, không nhanh cắn hay xạ hương.  Hoạt động vào ban đêm', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Hongkongsnakeid'),
(4768, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Oreocryptophis', NULL, 'GEN_1392', 'oreocryptophisporphyraceus', 'Oreocryptophis porphyraceus', '(Cantor, 1839)', 'Rắn sọc đốm đỏ', 'SPA_04820', 'Đầu nhỏ, nhọn và vuông, trong khi hoa văn màu sắc bao gồm màu đỏ hoặc cam, cùng với các dải hoặc sọc đen. Là loài sống trên cạn, nó thích khí hậu mát mẻ nên hạn chế môi trường sống của nó ở những ngọn đồi và cao nguyên núi. Nó được biết đến là loài hoạt động vào lúc hoàng hôn, hoạt động từ chiều tối cho đến đêm và bình minh cho đến sáng muộn. Trong điều kiện nuôi nhốt, nó là một trong những loài rắn chuột được săn lùng nhiều nhất.', NULL, 'Ấn Độ (Darjeeling, Sikkim, Assam, Arunachal Pradesh (Miao, Namdapha - huyện Changlang, Itanagar - huyện Papum Pare), Myanmar, Bhutan, Thái Lan, Lào, Campuchia, Việt Nam, Nepal, Nam Trung Quốc (Tây Tạng, Tứ Xuyên, Vân Nam, Hồng Kông , Hải Nam, về phía bắc đến Hà Nam và Cam Túc; về phía nam đến sông Wei He), Đài Loan, Tây Malaysia (Cao nguyên Cameron, Pahang), Indonesia (Sumatra). Địa phương được đưa ra là \"Ấn Độ: Assam, Mishmi Hills.\" từ Vườn quốc gia Lowachhara ở Đông Bắc Bangladesh', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.thainationalparks.com/species/oreocryptophis-porphyracea'),
(4769, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Orthriophis', NULL, 'GEN_1404', 'orthriophistaeniurus', 'Orthriophis taeniurus', '(Cope, 1861)', 'Rắn kim cương', 'SPA_04821', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4770, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Parahelicops', NULL, 'GEN_1450', 'parahelicopsannamensis', 'Parahelicops annamensis', 'Bourret, 1934', 'Rắn mũi Trung Bộ', 'SPA_04822', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4771, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Pareas', NULL, 'GEN_1471', 'pareascarinatus', 'Pareas carinatus', '(Boie, 1828)            ', 'Rắn hổ mây gờ', 'SPA_04823', ' thân mảnh mai, tổng chiều dài tối đa 702 mm; vảy trán hình lục giác, các cạnh bên song song với trục cơ thể; cặp khiên cằm trước dài hơn rộng; loreal và trán không tiếp xúc với mắt; 1-3 ống nhòm; thường là một mắt; thái dương 3 + 4 hoặc 3 + 3; ba hàng đốt sống giữa hơi to ra; 7-9 cái dưới môi; có 15 hàng vảy lưng, ở giữa thân 5 hàng vảy phía trên có thể hơi cong; 158-194 bụng; 54-96 phần dưới đuôi, tất cả đều chia đôi; lưng màu nâu vàng có các đốm đốt sống sẫm màu và lốm đốm sẫm màu, có hoặc không có các dải sẫm màu ngang trên cơ thể; các sọc phía trên sau ổ mắt tiếp tục ra sau gáy tạo thành một hoặc hai đốm đen dọc; mống mắt màu đồng ở hai bên, Hoạt động về đêm. Đây là loài bán sống trên cây. Thức ăn: sên và ốc sên; rắn pareid có nhiều răng ở hàm dưới bên phải hơn bên trái để chuyên môn hóa chức năng ăn phần lớn các loài ốc trên cạn. Sinh trứng ', NULL, ' Indonesia (Java, Lombok, Sumatra, Bali, Malaysia (Malaya và Đông Malaysia) Miến Điện (Myanmar), Thái Lan, Việt Nam, Lào , Campuchia, Trung Quốc (Vân Nam)', NULL, NULL, NULL, NULL, NULL, NULL, 'reptile-database'),
(4772, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Pareas', NULL, 'GEN_1471', 'pareasformosensis', 'Pareas formosensis', '(Van Denburgh, 1909)', 'Rắn ăn sên Đài Loan', 'SPA_04824', 'là loài rắn nhỏ, với chiều dài tổng cộng tới khoảng 70 cm (28 in). Nó phổ biến trong khu vực rừng ẩm ướt miền núi. Nó kiếm ăn ban đêm với nguồn thức ăn chủ yếu là sên và ốc sên. Rắn cái đẻ mỗi lứa 2–9 trứng; rắn non sơ sinh có chiều dài tới 15 cm (5,9 in)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4773, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Pareas', NULL, 'GEN_1471', 'pareashamptoni', 'Pareas hamptoni', '(Boulenger, 1905)            ', 'Rắn hổ mây Ham tơn', 'SPA_04825', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4774, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Pareas', NULL, 'GEN_1471', 'pareasmacularius', 'Pareas macularius', '(Blyth, 1868)            ', 'Rắn hồ mây đốm', 'SPA_04826', 'điểm vàng có vảy dạng sống và có “cổ loại II” trong khi margaritophorus có vảy nhẵn và có “cổ loại I”. Xem Hauser 217 để biết thêm chi tiết và số liệu, mặc dù mô tả tổng thể của anh ấy không rõ ràng lắm', NULL, 'Ấn Độ ? (Darjeeling, Sikkim, Tây Bengal), Bangladesh ?, Myanmar (= Miến Điện: Kachin, Mandalay, Mon, Shan, Tanintharyi, Yangon), Thái Lan (Chiang Mai), Lào (Xiangkhouang, Oudômxay, Champasak, Houaphan, Louangphrabang, Phongsali, Xaisomboun, Xiangkhoang), Việt Nam (Bắc Kạn, Cao Bằng, Hải Dương, Hòa Bình, Lai Châu, Nghệ An, Quảng Bình, Vĩnh Phúc), Nam Trung Quốc (Vân Nam, Quảng Tây, Quảng Đông, Quý Châu) Địa', NULL, NULL, NULL, NULL, NULL, NULL, 'https://reptile-database.reptarium.cz/species?genus=Pareas&species=macularius'),
(4775, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Pareas', NULL, 'GEN_1471', 'pareasmargaritophorus', 'Pareas margaritophorus', '(Jan,1866)             ', 'Rắn hổ mây ngọc', 'SPA_04827', 'Với chiều dài từ 20 đến 35 cm, rắn sên đốm trắng là một loài rắn nhỏ di chuyển chậm với thân hình màu xám phiến lốm đốm những đốm trắng và đen. Một cái đầu tròn đặc biệt với cổ mỏng hơn một chút, thân và đuôi cân đối. Bụng lốm đốm trắng đen với màu mắt không thể diễn tả được từ màu sắc và hoa văn trên đầu.   Hoàn toàn hoạt động về đêm, Rắn Sên Đốm Trắng là loài săn ốc sên và sên nhỏ ngoan ngoãn di chuyển chậm. Kết quả là nó được tìm thấy ở gần nhưng không sống trong nước. Nói chung hãy đứng yên khi đến gần và có thể vặn vẹo khi chạm vào nhưng không bao giờ cắn và không biết quá nhiều xạ hương. Sống ở những khu vực xung quanh những vùng nước nông, di chuyển chậm hoặc tĩnh lặng, nơi có thể tìm thấy chế độ ăn độc quyền của chúng là ốc nhỏ và sên. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'hongkongsnakeid'),
(4776, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Pareas', NULL, 'GEN_1471', 'pareasmonticola', 'Pareas monticola', '(CANTOR, 1839)', 'Rắn hổ mây núi', 'SPA_04828', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4777, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Plagiopholis', NULL, 'GEN_1570', 'plagiopholisdelacouri', 'Plagiopholis delacouri', 'Angel, 1929', 'Rắn hổ đất delacour', 'SPA_04829', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4778, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Plagiopholis', NULL, 'GEN_1570', 'plagiopholisnuchalis', 'Plagiopholis nuchalis', '(Boulenger, 1893)', 'Rắn hổ núi mũi mác', 'SPA_04830', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4779, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Plagiopholis', NULL, 'GEN_1570', 'plagiopholisstyani', 'Plagiopholis styani', '(Boulenger, 1899)', 'Rắn hổ đất', 'SPA_04831', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4780, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Psammodynastes', NULL, 'GEN_1641', 'psammodynastespulverulentus', 'Psammodynastes pulverulentus', '(Boie, 1827)', 'Rắn hổ đất nâu', 'SPA_04832', 'Đặc điểm nhận dạng:\n\nLoài rắn có kích thước nhỏ, chiều dài trung bình từ  30 - 35cm. Đầu hình tam giác rõ rệt, hoa văn khá vằn vện, do đó loài hổ đất nâu này thường bị nhầm lẫn với các loài rắn có nọc độc khác. Tuy nhiên nó là loài rắn hoàn toàn vô hại. Toàn thân màu nâu chocolate này được trang điểm bằng một đường nổi màu trắng chạy dài từ mắt đến mõm, mắt to, đồng tử đứng. Thân hình trụ, vảy trơn láng. Màu nền là nâu hay đỏ nhạt, phần bụng nâu nhạt hoặc hồng; hoa văn thường hay biến đổi. Những cá thể có vùng phân bố ở miền Bắc thường có màu cơ thể nhạt hơn so với màu đậm ở phía Nam và miền Trung Việt Nam.\n\nSinh học, sinh thái:\n\nThức ăn chủ yếu là thằn lằn và ếch và chúng săn mồi cả ngày lẫn đêm. Mỗi lứa đẻ từ 5 – 10 con, rắn con dài 15 - 1 8cm trông giống rắn trưởng thành. Loài sống trên cạn này cư trú ở các cánh rừng trên đồi, núi cao trên 700m, nhưng thỉnh thoảng ở những nơi thấp hơn.', NULL, 'Việt Nam: Cao Bằng (Ngân Sơn), Bắc Thái, Hoà Bình (Thượng Tiến, Vạn Mai), Quảng Ninh (Ba Mùn), Nghệ An (Tân Kỳ), Hà Tĩnh, Gia Lai (Sơklang), Đắc Lắc, Lâm Đồng, Phú Yên, Khánh Hoà, Tây Ninh, Đồng Nai (núi Chứa Chan, Trảng Bom, Định Quán), thành phố Hồ Chí Minh.\n\nThế giới: Loài này phân bố trên khắp vùng Đông nam châu Á sang Nepal, Đài Loan và Philippines.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4781, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Pseudoxenodon', NULL, 'GEN_1666', 'pseudoxenodonbambusicola', 'Pseudoxenodon bambusicola', 'Vogt, 1922', 'Rắn hổ xiên tre', 'SPA_04833', 'Nhiều màu sắc bao gồm thân màu xám với các dải đen/nâu và sọc lưng từ phần thứ hai đến đuôi, đôi khi có màu đỏ cam nhưng cũng có thể có màu vàng hoặc gần như xanh lục. Đầu có sọc đen từ phía sau hàm trên quấn quanh đầu và trên mắt. Vòng tròn màu đen từ đỉnh đầu vòng quanh đỉnh cổ, hiển thị dưới dạng vòng tròn lớn khi mũ trùm đầu được hiển thị. Đôi mắt to với con ngươi tròn. Đầu và cổ có thể dẹt rộng rãi khi có vẻ phòng thủ tương tự như rắn hổ mang. Về mặt kỹ thuật, là loài rắn có răng nanh phía sau, chúng có nọc độc nhẹ nhưng chưa có trường hợp nào bị nhiễm độc hoặc phản ứng nghiêm trọng ở người. Ngoài ra, nhãn \`răng nanh phía sau\` có thể gây hiểu nhầm phần nào vì răng nanh nằm nhiều hơn về phía 1/3 đầu tiên của miệng. Rắn hổ mang giả tre là loài rắn sống trên cạn, hoạt động ban ngày và vì vậy thường có thể được tìm thấy trong rác lá, mặc dù chúng được biết là dành thời gian ở những nơi có đá ẩm và trong thảm thực vật, đặc biệt là trên những khu vực có nước, nơi chúng được quan sát thấy ăn những con ếch nhỏ. Chúng cũng thường thể hiện hành vi hung hăng ban đầu bằng cách để lộ mũ trùm đầu và đứng dậy như một con rắn hổ mang. Chúng sẽ tấn công chủ yếu bằng những vết cắn giả và đôi khi là những vết cắn thật, nhưng việc có răng nanh phía sau khiến bất kỳ vết cắn thật nào tương đối vô hại. chúng thường được tìm thấy ở các vùng đất ngập nước nội địa hoặc gần một số nguồn nước thường xuyên. Có răng nanh phía sau và có nọc độc về mặt kỹ thuật nhưng không được biết là nguy hiểm đối với con người', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'hongkongsnakeid'),
(4782, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Pseudoxenodon', NULL, 'GEN_1666', 'pseudoxenodonkarlschmidti', 'Pseudoxenodon karlschmidti', 'Pope, 1928', 'Rắn hổ xiên kan smít', 'SPA_04834', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4783, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Pseudoxenodon', NULL, 'GEN_1666', 'pseudoxenodonmacrops', 'Pseudoxenodon macrops', '(Blyth, 1854)', 'Rắn hổ xiên mắt to', 'SPA_04835', 'Rắn có kích thước lớn. Dài thân đến 160cm. Khi đe dọa, loài rắn vô hại này ngóc đầu, cổ lên và phình cổ nó ra để bắt chước dáng vẻ của rắn hổ mang bành Naja naja hù đoạ kẻ thù. Đầu rắn khác biệt; mắt to với đồng tử tròn. Thân hình trụ có vảy gồ lên. Có một vạch màu đen trên cổ hình chữ V và đỉnh ở về phía đầu. Đâu và thân màu nâu chuyển sang xám. Có những đốm tròn màu vàng nhạt hoặc đỏ nhạt dọc theo mép bụng và các đốm tròn đen hai bên thân. Thức ăn chủ yếu của loài này là ếch, nhái. Mỗi lứa đẻ khoảng 10 trứng. Rắn hổ xiên mắt thường sống ở trong rừng rậm gần các dòng suối và ở độ cao khoảng 150 đến 200m so với mực nước biển.', NULL, 'Lào Cai (Sapa), Lạng Sơn (Mẫu Sơn), Vĩnh Phú (Tam Đảo), Quảng Nam – Đà Nẵng, Huế (VQG Bạch Mã), Lâm Đồng (VQG Bidoup, Núi Bà)   Hymalaya, Nepal, Trung Quốc, Mianma, Lào, Thái Lan và Malaysia.', NULL, NULL, NULL, NULL, NULL, NULL, 'agriviet'),
(4784, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Ptyas', NULL, 'GEN_1685', 'ptyascarinata', 'Ptyas carinata', '(GÜNTHER, 1864)', 'Rắn ráo gờ', 'SPA_04836', ' Chúng có cơ thể màu sẫm và có màu từ đen tuyền, xám xanh đến nâu. Đầu có màu nâu ở trên, màu trắng ở dưới và khác biệt với cổ. Những con rắn này có thể dài tới hơn 3 mét  Ngoài việc ăn thịt loài gặm nhấm, chúng còn ăn thịt đồng loại và ăn các loài rắn khác.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Mybis'),
(4785, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Ptyas', NULL, 'GEN_1685', 'ptyaskorros', 'Ptyas korros', '(Schlegel, 1837)            ', 'Rắn Ráo ', 'SPA_04837', 'Rắn lành có chiều dài cơ thể khoảng 2m. Đầu rắn thuôn dài, phân biệt rõ với cổ. Mắt rất to, đường kính mắt bằng hoặc lớn hơn chiều dài từ lỗ mũi đến mắt. Đuôi dài, ít nhất chiếm 30% chiều dài toàn thân. Mặt lưng có màu xanh xám, ở phía sau cơ thể chuyển sang màu nâu nhạt với những vẩy thân có viền đen ngày càng rõ hơn. ở phần trước của mặt bụng có màu vàng tươi, phần sau có màu trắng hay vàng nhạt. Cá thể cái có thân mảnh hơn, thân và đuôi ngắn hơn, đầu hẹp và mõm ngắn hơn, mắt nhỏ hơn, gốc đuôi thuôn dài và chóp đuôi tù Là loài rắn lành sống trên cạn, song bò, leo cây và bơi lội tốt. Chúng ưa sống trong các bụi cây tre quanh làng, hay trong đồng ruộng, trong các bụi cây, bụi rậm gần nước, trong vườn cây gia đình. Nhiều trường hợp chúng đột nhập cả vào nhà dân, leo trên xà nhà để bắt chuột. Kiếm ăn chủ yếu vào ban ngày, ở miền Nam có thể cả ban ngày lẫn ban đêm. Con mồi chủ yếu là chuột, chim non, trứng chim, thạch sùng, thằn lằn bóng, ếch nhái. Mồi chủ yếu là chuột và ếch nhái. Sau khi nuốt mồi, chúng thường nằm trên các cành cây cao hoặc trong bụi rậm để tiêu hoá thức ăn. Thời kỳ sinh sản từ tháng 3 - 6 (thường vào tháng 5). Giao phối tập thể, sau khi giao hoan, 4 cá thể đực cuốn lấy 2 cá thể cái làm thành một búi, sau 20 phút, cá thể đực phóng tinh, song vẫn ở trạng thái cuộn vào nhau, từ 2 đến 7 giờ. Cá thể cái mang trứng khoảng gần 80 ngày. Thường đẻ trứng vào tháng 7 (từ tháng 6 - 8). Mỗi lứa từ 2 - 6 trứng. Thời gian trứng nở 56 - 58 ngày. Rắn non mới nở dài trung bình 243mm, nặng trung bình 43g. Về mùa đông rắn trú đông trong hang chuột hoặc mối. Chúng lột xác trong mùa hoạt động từ tháng 3 - 11', NULL, 'Phân bố ở hầu hết các tỉnh ở đồng bằng, trung du và miền núi từ Bắc vào Nam Ấn Độ, Bănglađét, Nam Trung Quốc, Mianma, Lào, Thái Lan, Cămpuchia, Malaixia, Xingapo, Indonesia', NULL, NULL, 'Có giá trị khoa học và thẩm mỹ. Là đối tượng nghiên cứu khoa học và giúp cân bằng sinh thái trong tự nhiên. Tuy nhiên loài rắn này cũng có giá trị kinh tế nếu nhân nuôi', ' EN A1c,d', 'NT', NULL, 'VnCreature'),
(4786, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Ptyas', NULL, 'GEN_1685', 'ptyasmajor', 'Ptyas major', '(Günther, 1858). ', 'Rắn đai lớn', 'SPA_04838', 'màu xanh lá cây tươi sáng với phần bụng màu vàng. Thường không dài quá 1 mét, chúng có thân hình thon dài và đầu dài hẹp với đôi mắt tương đối to và con ngươi tròn. hoạt động vào ban ngày để săn nhiều con mồi khác nhau nhưng phần lớn tiêu thụ giun đất, nghĩa là chúng dành nhiều thời gian trên mặt đất. vào ban đêm chúng thường đậu trên cây hoặc bụi rậm hoặc bãi cỏ dài ở những khu vực có nhiều cây cối.  chúng có thể được tìm thấy ở hầu hết mọi nơi có nước, thảm thực vật, đất mềm và rác lá/gỗ mục nát.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'hongkongsnakeid'),
(4787, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Ptyas', NULL, 'GEN_1685', 'ptyasmucosa', 'Ptyas mucosa', '(Linnaeus, 1758)            ', 'Rắn ráo trâu', 'SPA_04839', 'mõm tù, hơi nhô ra; mắt to, có thể nhìn thấy từ trên cao; đường khâu giữa các bên trong ngắn hơn đường khâu giữa các bên trước; phần trán dài bằng khoảng cách tính từ điểm cuối của mõm, dài bằng phần đỉnh hoặc ngắn hơn một chút; thường là ba loreals; một thị kính lớn, với một thị kính phụ nhỏ bên dưới; hai ống nhòm; thái dương 2+2; 8 môi trên, thứ tư và thứ năm đi vào mắt; 5 Môi dưới tiếp xúc với tấm chắn cằm trước, ngắn hơn phía sau; cái sau tiếp xúc ở phía trước. vảy lưng xếp thành 17 hàng ở giữa thân, có phần lồi lõm ít nhiều ở phần sau của cơ thể. Bụng 190-208; chia hậu môn; phần dưới đuôi 95-135, chia đôi. Phía trên màu nâu, thường có các dải chéo màu đen ít nhiều rõ ràng ở phần sau của cơ thể và trên đuôi; còn non thường có các dải chéo nhẹ ở nửa trước của cơ thể. Mặt dưới màu vàng; phần bụng sau và tấm chắn đuôi có thể có viền màu đen. hoạt động ban ngày và bán sống. Chúng sinh sống ở các tầng rừng, vùng đất ngập nước, cánh đồng lúa, đất nông nghiệp và khu vực ngoại ô, nơi chúng săn mồi các loài bò sát nhỏ, động vật lưỡng cư, chim và động vật có vú. giao phối vào cuối mùa xuân và đầu mùa hè, mặc dù ở các vùng nhiệt đới sinh sản có thể diễn ra quanh năm. Con đực thiết lập ranh giới lãnh thổ bằng cách sử dụng một bài kiểm tra sức mạnh theo nghi thức, trong đó chúng đan xen cơ thể của mình.   Con cái đẻ 6-15 quả trứng mỗi lứa vài tuần sau khi giao phối.', NULL, ' Afghanistan, Bangladesh, Miến Điện (Myanmar), Campuchia, Trung Quốc (Chiết Giang, Hồ Bắc, Giang Tây, Phúc Kiến, Quảng Đông, Hải Nam, Quảng Tây, Vân Nam, Tây Tạng, Hồng Kông), Ấn Độ, Sri Lanka, Indonesia (Sumatra, Java), Iran, Lào, Tây Malaysia, Nepal, Myanmar, Pakistan (Sindh khu vực), Đài Loan, Thái Lan, Turkmenistan, Việt Nam', NULL, NULL, NULL, NULL, NULL, NULL, 'thainationalparks'),
(4788, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Ptyas', NULL, 'GEN_1685', 'ptyasmulticincta', 'Ptyas multicincta', '(Roux, 1907)            ', 'Rắn nhiều đai', 'SPA_04840', 'Răng hàm trên 18-20, một hoặc hai răng trước và sau nhỏ hơn những răng còn lại, đường kính của mắt nhỏ hơn khoảng cách từ lỗ mũi; mõm lồi rõ rệt, nhìn nghiêng không rõ ràng, các mũi bên trong của canthus rostralis thu hẹp về phía trước, mõm, nhọn hơn ở các loài thể dục lớn cũng như ở loài trưởng thành.  Phía trên màu xanh lục, phía sau trở nên xám hơn, màu sắc kéo dài đến mép ngoài của vảy bụng ở nửa sau của thân và đuôi, có nhiều sọc ngang hẹp, màu trắng, viền đen, có thể toàn bộ hoặc xen kẽ với các cạnh đối diện ở một số cá thể, chúng rất không rõ ràng và có thể hoàn toàn không có viền màu đen không nhất quán và hoa văn thường được hình thành bởi một nửa thang màu tối, nửa còn lại sáng; bụng màu trắng, nhiều hay ít phủ bột dày màu xanh lá cây hoặc xám, hoặc hoàn toàn màu xám ở phía sau ', NULL, 'Bắc Việt Nam.   Trung Quốc (Hải Nam, Quảng Tây, Nam Vân Nam, Quảng Đông), Lào, Việt Nam (Hòa Bình), Thái Lan (Uttaradit)\n', NULL, NULL, NULL, NULL, NULL, NULL, 'reptile-database'),
