(4791, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Rhabdophis', NULL, 'GEN_1722', 'rhabdophiscallichroma', 'Rhabdophis callichroma', '(Bourret, 1934)            ', 'Rắn hoa cỏ ba vì', 'SPA_04843', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4792, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Rhabdophis', NULL, 'GEN_1722', 'rhabdophischrysargos', 'Rhabdophis chrysagus', '(Schneider, 1837)            ', 'Rắn hoa cỏ vàng', 'SPA_04844', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4793, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Rhabdophis', NULL, 'GEN_1722', 'rhabdophisnigrocinctus', 'Rhabdophis nigrocinctus', '(Blyth, 1856)', 'Rắn hoa cỏ đai', 'SPA_04846', 'Loài rắn có kích thước nhỏ, dài thân khoảng 95 cm. Thân có nhiều màu sắc đẹp lúc con non khác với rắn trưởng thành. Rắn trưởng thành có thân màu xanh lục sẫm nhưng phía thân sau chuyển sang màu xanh lục pha nâu nhạt. Hai bên thân có các vạch đen có thể nối liền với mép bụng. Đầu màu nâu đậm có những đường đen; phần trên mép màu xám. Cằm, cổ họng, và phần bụng màu trắng chuyển sang màu hơi xám về phía sau, phần dưới đuôi màu xám đậm với các đường rìa màu trắng.', NULL, 'Việt Nam: Đã gặp loài này ở Lai Châu (Mường Nhé). Vườn quốc gia Bidoup - Núi Bà thuộc tỉnh Lâm Đồng.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5004'),
(4794, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Rhabdophis', NULL, 'GEN_1722', 'rhabdophisnuchalis', 'Rhabdophis nuchalis', '(Boulenger, 1891)            ', 'Rắn hoa cỏ gáy', 'SPA_04847', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4795, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Rhabdophis', NULL, 'GEN_1722', 'rhabdophissubminiatus', 'Rhabdophis subminiatus', '(Schlegel, 1837)            ', 'Rắn hoa cỏ nhỏ', 'SPA_04848', 'Rắn hoa cỏ cổ đỏ về hình thể, có kích thước trung bình, tổng chiều dài giống đực (77+23) milimét, giống cái (945+19) milimét. Đầu và lưng có màu xanh cỏ, vảy môi trên có màu hơi nhạt, bộ phận rãnh vảy có màu đen; mặt bụng phần đầu có màu trắng đục. Mình và mặt lưng đuôi có màu xanh cỏ, vùng cổ và da thịt giữa các mảng vảy của đoạn thân trước có màu đỏ; mình và mặt bụng đuôi có màu trắng vàng.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/R%E1%BA%AFn_hoa_c%E1%BB%8F_c%E1%BB%95_%C4%91%E1%BB%8F'),
(4796, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Rhabdophis', NULL, 'GEN_1722', 'rhabdophisvigsocintus', 'Rhabdophis vigsocintus', '(Schlegel, 1837)            ', 'Rắn hoa cỏ đai', 'SPA_04849', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4797, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Rhadinophis', NULL, 'GEN_1725', 'rhadinophisprasina', 'Rhadinophis prasina', '(Blyth, 1854)', 'Rắn sọc xanh', 'SPA_04850', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4798, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Rhynchophis', NULL, 'GEN_1748', 'rhynchophisboulengeri', 'Rhynchophis boulengeri', 'Mocquard, 1897            ', 'Rắn vòi', 'SPA_04851', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4799, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Sibynophis', NULL, 'GEN_1816', 'sibynophischinensis', 'Sibynophis chinensis', '(Günther, 1889)', 'Rắn rồng Trung Quốc', 'SPA_04852', 'Với chiều dài từ 40 đến 50 cm, rắn núi Trung Quốc là một loài nhỏ có đầu màu đen xám chuyển dần sang cổ màu rám nắng. Màu sắc cơ thể chuyển tiếp liền mạch từ màu rám nắng ở đầu sang màu nâu đỏ, sau đó là màu nâu, rồi màu nâu xám đậm ở đuôi. Một sọc lưng mờ có thể được nhìn thấy trên hầu hết các mẫu vật bắt đầu từ đầu và mờ dần ở một phần ba đầu tiên của cơ thể. Sự chuyển màu từ đầu đến cổ cũng được phân định bằng dải mỏng màu trắng hoặc vàng.  Hoạt động chủ yếu vào ban ngày, Rắn núi Trung Quốc là loài săn thằn lằn nhỏ ngoan ngoãn. Kết quả là nó được tìm thấy ở gần nhưng không sống trong nước. Nói chung di chuyển nhanh chóng khi đến gần và có thể vặn vẹo khi chạm vào nhưng không có khả năng cắn và không biết nhiều về xạ hương. Rất nhanh khi bị giật mình mặc dù tốc độ di chuyển thường chậm. Sống trong rừng ẩm hoặc vùng đồi núi gần nước. Giống như nhiều loài rắn, đôi khi chúng có thể được tìm thấy ở vùng nước đánh bắt. Lan truyền rộng rãi khắp Hồng Kông nhưng không phổ biến lắm', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'hongkongsnakeid'),
(4800, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Sibynophis', NULL, 'GEN_1816', 'sibynophiscollaris', 'Sibynophis collaris', '(Gray, 1853)', 'Rắn rồng cổ đen', 'SPA_04853', 'Rắn rồng cổ đen là loài rắn có kích thước trung bình với chiều dài khoảng 85cm. Đầu của chúng có màu ôliu đậm chuyển sang nâu, thường có các vệt nhỏ màu đậm hơn. Hoa văn trên cổ thay đổi, nhưng trong khu vực phân bố ở nước ta nó là một vòng cổ hình tam giác có màu trắng vàng nhạt bao quanh. Thân màu nâu chuyển sang nâu xám, với một đường sọc đen hoặc một hàng chấm tròn đen phía dưới sống lưng. Loài rắn phân bố ở độ cao vừa và cao trong lòng đất rừng mưa nhiệt đới. Thức ăn của nó chủ yếu là loài Thằn lằn bóng chân ngắn. Con cái đẻ tối đa 6 trứng và làm tổ trong các bọng cây, hốc đá.', NULL, ' Yên Tử, Lai Châu, Nghệ An (Kỳ Sơn), Quảng Trị, Thừa Thiên Huế, Gia Lai (Soklang), Lâm Đồng (Bảo Lộc, Đà Lạt, Langbiang), Đồng Nai (Biên Hoà)  Thái Lan và bán đảo Mã Lai, phía Đông dãy chân núi Himalaya, Ấn Độ, Lào, Mianma.', NULL, NULL, NULL, NULL, NULL, NULL, 'agriviet'),
(4801, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Sinonatrix', NULL, 'GEN_1826', 'sinonatrixaequifasciata', 'Sinonatrix aequifasciata', '(Barbour, 1908)            ', 'Rắn nước hoa cân vân đốm', 'SPA_04854', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4802, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Sinonatrix', NULL, 'GEN_1826', 'sinonatrixpercarinata', 'Sinonatrix percarinata', '(Boulenger, 1899)            ', 'Rắn hoa cân vân đen', 'SPA_04855', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4803, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Sinonatrix', NULL, 'GEN_1826', 'sinonatrixyunnanensis', 'Sinonatrix yunnanensis', 'Rao&Yang, 1998', 'Rắn hoa cân vân nam', 'SPA_04856', 'Chiều dài từ mút mõm đến lỗ huyệt 354 mm ở con đực, 700 - 870 mm ở con cái. Dài đuôi 100 mm ở con đực và 218 - 260 mm ở con cái. Thân gần hình trụ. Đầu thon dài, không phân biệt với cổ. Gáy có nếp rõ. Vảy gian mũi dài bằng vảy trước trán. Vảy trước trán ngắn hơn vảy chẩm. Xuất hiện vảy má.. Vảy trước mắt 1/1. Vảy sau mắt 3/3. Vảy thái dương phía trước 2/2. Vảy thái dương phía sau 3/3. Vảy môi trên 9/9, trong đó vảy thứ tư và năm chạm mắt, vảy thứ bảy lớn nhất. Răng hàm trên có 31 - 32 cái. Vảy môi dưới 10/10, vảy đầu tiên đến vảy thứ năm bao quanh vảy cằm. Vảy lưng kết sừng, công thức các hàng vảy: 19 - 19 - 17. Vảy bụng 160 - 162. Lỗ huyệt phân rẽ. Vảy dưới đuôi 60 - 74, phân chia. Màu trong trạng thái tiêu bản: Mặt lưng của đầu màu nâu đen. Không có hoa văn. Mặt lưng của thân màu nâu ở con đực và con cái có màu xám quả ô lưu cùng với 27 - 29 vết loang rộng ngang thân dạng chữ X ở mặt bên của thân và 12 vết trên đuôi. Bụng màu kem có nhiều vết đen ở phần sau của thân và đuôi. Số lượng vết chữ X khoảng 32 - 46 vết trên mẫu ở Trung Quốc, 39 - 41 vết trên mẫu bắt ở Việt Nam.', NULL, 'Trong nước: Miền Trung Tây Nguyên.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=67&loai=1&img=1&ID=6213'),
(4804, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Trimerodytes', NULL, 'GEN_1991', 'trimerodytespercarinatus', 'Trimerodytes percarinatus', '(Boulenger, 1899)', 'Rắn hoa cân vân đen', 'SPA_04857', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4805, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Xenochrophis', NULL, 'GEN_2048', 'xenochrophisflavipunctatus', 'Xenochrophis flavipunctatus', '(Hallowell, 1861)', 'Rắn nước', 'SPA_04858', 'Đặc điểm nhận dạng:\n\nĐầu thuôn dài phân biệt với cổ. Mắt bé, con ngươi tròn. Lỗ mũi nằm giữa tấm mũi chia. Có hai tấm gian mũi bé hơn hai tấm trước trán; tấm trán dài hơn gấp 2 lần rộng, dài hơn khoảng cách từ nó đến mút mõm; hai tấm đỉnh lớn. Có một tấm má rộng bằng cao, một tấm trước mắt cao, phân cách tấm trán bởi tấm trên mắt. Ba tấm sau mắt, hai tấm dưới mắt, tấm thứ hai phân cách mắt với tấm mép trên thứ 6. Vảy thái dương 2+2, dài và nhẵn. Tấm cằm hình tam giác, đường viền của tấm cằm bé hơn tấm mõm. Có 2 cặp tấm cằm sau, cặp thứ nhất tiếp xúc nhau hoànn toàn và ngắn hơn cặp thứ hai.\n\nCó 9 tấm mép trên, một phần tấm thứ 4 và tấm thứ 5 chạm mặt, 10 tấm mép dưới, cặp tấm đầu tiên chạm nhau sau tấm cằm, 5 tấm tiếp xúc với tấm sau cằm thứ nhất ở mỗi bên. Có 19 hàng vảy thân có gờ trừ hai hàng ngoài cùng nhẵn. 137 vảy bụng, 71 vảy dưới đuôi. Tấm hậu môn chia\n\nChiều dài thân 558mm, chiều dài đuôi 210mm, SV = 9, IL =10, C = 19, V = 137, SC = 71. Thân màu nâu xám, có các vân đen ngang ở trên và bên lưng, đôi khi xen kẽ các vệt nâu đỏ nhạt. mặt trên đầu sẫm hơn, có hai vệt đen từ mắt tới các tấm mép trên thứ 6 và thứ 8, một vệt đen khác từ sau góc hàm đến gáy. Bụng màu trắng đục, mép trước của tấm bụng thường có viền đen.\n\nSinh học, sinh thái:\n\nRắn nước săn các con mồi gồm cá và chuột làm thức ăn. Loài này đẻ rất nhiều: đã từng được ghi nhận là có những ổ trứng lên đến 100 trứng, mặc dù mức độ bình thường là 17 - 52 trứng. Thời gian ấp trúng từ năm đến bảy tuần, rắn con dài 15 - 21cm. Loài rắn sống trên cạn phổ biến này hoạt động suốt ngày đêm, sống ở ao hồ, suối, các cánh đồng lúa và các vùng nước ngọt ở độ cao tới 1.600m', NULL, 'Việt Nam: Loài này phân bố rất rộng chúng hầu như có từ Bắc đến Nam và có rất nhiều ở đồng bằng sông Cửu Long\n\nThế giới: Thái Lan, Cambodia, Lào, Trung Quốc, Malaixia, Ấn Độ, Nêpan.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4806, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Xenochrophis', NULL, 'GEN_2048', 'xenochrophispiscator', 'Xenochrophis piscator', '(Schneider,1799)             ', 'Rắn Nước', 'SPA_04859', 'Lưng màu xám, nâu hoặc ôliu với nhiều chấm đen tạo thành hình ca rô kéo dài đến tận đuôi hoặc nhạt dần khoảng nửa thân. Một số cá nhân có thể có đốm đỏ hoặc cam ở mặt dưới. Bụng màu trắng với viền đen ở mỗi bên. Hai vệt đen phía sau mỗi mắt, đôi khi có một mảng màu vàng ở giữa, đặc biệt là ở cá con. Cổ có dấu chữ \"V\" màu đen. Có thể tìm thấy một vệt ngắn màu vàng trên đỉnh đầu. Thích ao, suối và mương ở vùng đất trũng trong các cánh đồng canh tác. Đôi khi được tìm thấy ở các lưu vực vùng cao', NULL, 'Hầu khắp các tỉnh có rừng từ Bắc vào Nam nam Trung Quốc bao gồm Đài Loan, Nam và Đông Nam Á', NULL, NULL, 'có giá trị nghiên cứu khoa học và góp phần điều hoà số lượng cá thể các quần thể con mồi, giúp cân bằng sinh thái tự nhiên', NULL, 'NE', NULL, 'VnCreature'),
(4807, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Xenochrophis', NULL, 'GEN_2048', 'xenochrophistrianguligerus', 'Xenochrophis trianguligerus', '(Boie, 1827)', 'Rắn nước vân tam giác', 'SPA_04860', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4808, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Colubridae', 'Rắn Nước', 'FAM_098', 'Zaocys', NULL, 'GEN_2067', 'zaocysdhumnades', 'Zaocys dhumnades', '(Cantor, 1842)', 'Rắn hổ mực gờ', 'SPA_04861', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4809, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Dibamidae', 'Thằn Lằn Giun', 'FAM_121', 'Dibamus', NULL, 'GEN_0574', 'dibamusbourreti', 'Dibamus bourreti', 'Angel, 1935', 'Thằn lằn giun Buerê', 'SPA_04862', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4810, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Elapidae', 'Rắn Hổ', 'FAM_128', 'Bungarus', NULL, 'GEN_0263', 'bungaruscandidus', 'Bungarus candidus', '(Linnaeus, 1758)            ', 'Rắn cạp nia nam', 'SPA_04863', 'Chạy dọc trên thân hình trụ của loài rắn cạp nia nam này là những khoanh màu đen trắng xen kẽ nhau; gồm từ 19 đến 30 khoanh màu đen không vòng qua thân bụng và 7 đến 9 khoanh trên đuôi Các vảy màu đen riêng lẻ thường phân bố trên các khoanh màu trắng ở nơi nối tiếp với phần bụng màu trắng. Đầu rắn màu đen xám, phía trên hai bên miệng màu sáng hơn một chút. Như tất cả loài rắn thuộc giống Bungarus đều có các vảy trơn nhẵn và phình rộng nơi xương sống. Là loài ăn đêm và săn mồi chủ yếu là các loại rắn khác. Con cái đẻ từ 4 - 10 trứng mỗi năm; rắn con dài 27 - 29cm. Nọc độc của chúng có khả năng gây chết người và sống ở các khu rừng rậm nhiệt đới và đã gặp ở độ cao lên tới 1.500m.', NULL, 'Việt Nam: Nghệ An - Vinh, Quảng Bình - Bố Trạch, Thừa thiên Huế, Đắc Lắc - Đạo Nghĩa, Lâm Đồng - Đà Lạt, Khanh Hòa - Đại Lãnh, Ninh Thuận - Phan Rang, Tây Ninh -  Lò Gò, Sa Mác, Đồng Nai - Biên Hoà, Bảy núi - An Giang. Thế giới: Rắn cạp nia Nam phân bố trên khắp Thái Lan, Mã Lai, Singapore, Đông dương và vài nơi ở Indonesia.', NULL, NULL, NULL, NULL, NULL, NULL, 'Vn Creature'),
(4811, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Elapidae', 'Rắn Hổ', 'FAM_128', 'Bungarus', NULL, 'GEN_0263', 'bungarusfasciatus', 'Bungarus fasciatus', '(Schneider, 1801)            ', 'Rắn Cạp Nong', 'SPA_04864', 'Rắn độc cỡ tương đối lớn, thường dài trên 1m. Đầu lớn và ngắn, ít phân biệt với cổ, mắt tương đối nhỏ và tròn, thân thường nặng nề, đuôi ngắn, mút đuôi tròn, giữa sống lưng có một gờ dọc rất rõ. Hàng vảy sống lưng hình sáu cạnh, lớn hơn vảy bên. Thân có khoanh đen và khoanh vàng xen kẽ, các khoanh xấp xỉ bằng nhau Rắn cạp nong sinh sống ở nhiều loại môi trường sống, từ núi đất, rừng thưa, trảng cỏ, ven khe suối, nương rẫy. Chúng sinh sống trong gò mối và hang của động vật gặm nhấm, trong hốc cây, hẻm đá. Rắn cạp nong sống đơn lẻ, ban ngày chúng cuộn mình trong các hang, đám cỏ, và thường rất chậm chạp. Chúng thường được thấy khi trời mưa. Ban đêm rắn hoạt động và đi kiếm ăn ở bờ ruộng gần rừng, ven khe suối, vũng nước. Cạp nong không săn đuổi mồi mà chúng thường nằm chờ cho con mồi đi qua. Chúng bơi giỏi và thường bò theo ánh lửa. Rắn cạp nong cái đẻ và canh giữ trứng trong khoảng tháng 4 đến tháng 5 hàng năm', NULL, 'Hầu khắp các tỉnh có rừng từ Bắc vào Nam  Ấn Độ, Bangladesh, Nam Trung Quốc và Đông Nam Á', NULL, NULL, 'Có giá trị khoa học, thẩm mỹ, là tác nhân cân bằng sinh thái trong môi trường tự nhiên', 'EN A1c,d', 'LC', NULL, 'VnCreature'),
(4812, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Elapidae', 'Rắn Hổ', 'FAM_128', 'Bungarus', NULL, 'GEN_0263', 'bungarusmulticinctus', 'Bungarus multicilctus', 'BLYTH, 1861', 'Rắn cặp nia bắc', 'SPA_04865', 'Đầu không phân biệt rõ với cổ, dọc cơ thể khoanh màu đen trắng xen kẽ nhau. Mắt trung bình, con ngươi tròn. Lưng màu đen, có 3 dải (1 ở sống lưng, mỗi bên 1 dải chạy dọc theo nơi tiếp giáp hàng vảy thân thứ nhất và hai) màu đỏ hay vàng. Có 193 - 236 tấm bụng; tấm hậu môn đơn; tấm dưới đuôi: sát hậu môn đơn, phía sau kép Phần sau cơ thể và dưới màu vàng hay da cam Là loài ăn đêm và săn mồi chủ yếu là các loại rắn khác. Con cái đẻ từ 4 - 10 trứng mỗi năm; rắn con dài 27 - 29cm. Nọc độc của chúng có khả năng gây chết người và sống ở các khu rừng rậm nhiệt đới và đã gặp ở độ cao lên tới 1.500m. Loài rắn độc tố thần kinh tiền synape và hậu synape, gây liệt mềm, thường khởi đầu đau họng, sụp mi, nói khó, sau đó liệt cơ hoành, cơ liên sườn và liệt chi. Liệt kéo dài nhiều ngày. Có giãn đồng tử. Bệnh nhân thường có mạch nhanh, huyết áp tăng, vã mồ hôi, bí đái, táo bón. Hạ natri máu. Tử vong chủ yếu do suy hô hấp do liệt các cơ hô hấp', NULL, 'Loài này chỉ phân bố phía Bắc gồm Vĩnh Phúc, Cao Bằng, Bắc Cạn, Lạng Sơn, Hòa Bình, Hà Nội, Nghệ An và Hà Tĩnh Nam Trung Quốc và Lào', NULL, NULL, 'Có giá trị nghiên cứu khoa học và góp phần điều hoà số lượng cá thể các quần thể con mồi, giúp cân bằng sinh thái tự nhiên', NULL, 'LC', NULL, 'VnCreature'),
(4813, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Elapidae', 'Rắn Hổ', 'FAM_128', 'Bungarus', NULL, 'GEN_0263', 'bungarusslowinskii', 'Bungarus slowinskii', 'Kuch, Kizirian, Nguyen, Lowson, Donnelly, and Mebs, 2005', 'Rắn cạp nia', 'SPA_04866', 'Dài thân 125 cm. Dài đuôi 15 cm, chót nhọn. Mõm tròn. Đầu phân biệt cổ. Thân hóp mặt bên, có riềm xương sống rõ. Vảy lưng mịn, lóng lánh. Hàng vảy xương sống nở rộng và hình lục giác. Công thức vảy lưng 15 - 15 - 15. Mặt trên của đầu màu đen có vết chữ V đốm trắng, đỉnh của nó ngay trước chóp trước của vảy trán và các chân của vết chữ V ấy trải ra sau lên vảy chẩm và tới khoé mõm, nơi mà chúng hoà lẫn với họng trắng. Đường sọc trắng trải dài ngay trước đỉnh quá chiều rộng của cặp vảy trước trán và trải rộng đến trên vảy môi trên thứ hai ngay trước mắt đen nhỏ. Lưỡi màu hồng có chót trắng. Thân và đuôi màu đen, có vết trắng. Hai vết trắng sau đầu hình chữ V. tất cả những vết khác hình vòng khuyên hoặc tương tự thế. Cả vết trắng và đen trải rộng mặt bên lên mặt dưới của rắn. Có 32 khoang trắng và 32 khoang đen trên thân/. Đuôi có 5 khoang trắng và 6 khoang đen, bao gồm cả chót đuôi đen. Độ rộng của các khoang trắng đen hầu như đều nhau ở mặt dưới, còn mặt trên, chiều rộng khoang trắng chỉ bằng một nửa khoang đen. Một đặc điểm nổi bật của khoang trắng đó là tất cả các vảy trắng của khoang này đều có viền đen ở nửa sau vảy mà hoà lẫn với đỉnh vảy đen phía sau. Có hai vảy trước bụng và 225 vảy bụng. Vảy huyệt không phân chia. Dưới đuôi có 35 cặp vảy chia đôi. Cằm hình tam giác/. Vảy cằm phía sau dài hơn phía trước. Rãnh cằm lồi', NULL, 'Loài rất hiếm gặp và chỉ gặp ở các khu rừng thường xanh còn tốt từ Bắc vào đến Huế (Vườn quốc gia Bạch Mã).', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=5&loai=1&img=1&ID=5639'),
(4814, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Elapidae', 'Rắn Hổ', 'FAM_128', 'Calliophis', NULL, 'GEN_0284', 'calliophisintestinalis', 'Calliophis intestinalis', '(Laurenti, 1768)', 'Rắn lá khô sọc ', 'SPA_04867', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4815, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Elapidae', 'Rắn Hổ', 'FAM_128', 'Calliophis', NULL, 'GEN_0284', 'calliophismacclellandi', 'Calliophis macclelandi', 'Reinhardt, 1844', 'Rắn vú nàng Maclen', 'SPA_04868', 'Loài rắn nhỏ có kích thước trung bình khoảng 40 - 60cm chiều dài, một vài cá thể dài đến 80cm. Đầu của loại rắn nhiều màu sắc này màu đen; phía sau mắt có một dải màu ngà voi rộng và kế tiếp là một dải màu đen rộng. Thân màu đỏ nhạt, trên lưng có từ 23 đến 40 khoanh màu đen hẹp vắt ngang, vài khoanh không hoàn chỉnh phía bên hông thân. Đuôi có từ hai đến sáu vạch màu đen. Cằm rắn màu kem; phần bụng màu vàng nhạt có những vệt đen.\nSinh học, sinh thái:\nLoài rắn ăn đêm này thường săn các loài rắn khác và thằn lằn và thường sống ở nơi đất thấp ở các khu vực rừng thường xanh núi cao có độ cao trên 1.000m. Sống chhui rúc dưới những đám thảm mục thực vật trong rừng. Loài này có độc tố, khi bắt con mồi  nọc độc thần kinh sẽ làm tê liệt con mồi trước khi nuốt. Mặc dù là loài rắn rất hiền lành nhưng chúng sở hữu một chất độc thần kinh mạnh. Đã ghi nhận nọc độc của chúng gây ra một vài trường hợp tử vong  ở Thái Lan.\nLoài này thường sinh sản vào cuối mùa mưa và con cái đẻ từ 10  - 14 trứng. Trướng được vùi trong lớp thảm mục thực vật trong rừng.', NULL, 'Việt Nam: Cao Bằng (Ngân Sơn), Lào Cai (Sapa), Bắc Thái (Bắc Kạn, Ký Phú), Lạng Sơn Vĩnh Phú (Khả Cửu, Tam Đảo), Hà Tây (Ba Vì), Thừa thiên Huế, Lâm Đồng (Đà Lạt).\nThế giới: Rắn lá khô thường có mặt trên khắp phía Đông các đồi ở chân núi Himalaya, và phân bố tại các vùng phía Bắc và Nam Thái Lan, Nêpan, Ấn Độ', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=3&loai=1&img=1&ID=5029'),
(4816, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Elapidae', 'Rắn Hổ', 'FAM_128', 'Calliophis', NULL, 'GEN_0284', 'calliophismaculiceps', 'Calliophis maculiceps', '(Gunther, 1858).', 'Rắn lá khô đốm nhỏ', 'SPA_04869', 'Đầu của loài rắn có khả năng biến đổi màu này màu đen nâu nhạt, thân có màu cam đậm hoặc nâu đỏ nhạt. Hoa văn trên thân có thể gồm những chấm lớn riêng rẽ cách xa nhau bên hông, các chấm tròn lớn không đều nhau, trên sống lưng có hoa văn xoắn màu đen, sọc đen trên lưng hoặc không có hoa văn gì trên thân. Phần thân và chóp đuôi có một khoanh màu đen. Mặt bụng màu hồng; phía dưới đuôi có các khoảng màu đen và trắng không cân xứng. Kích thước khoảng 47cm. Con cái mỗi năm đẻ 1 lần, mỗi lần đẻ 2 trứng, Thức ăn chính của chúng là những loài rắn nhỏ, đặc biệt là giống Typhlops sp., thằn lằn. Chúng có nọc độc và nguy hiểm. Khi bị kích động chúng thường dưa phần mặt dưới màu đen, trắng bác lên và cuộn tròn nhằm đe dọa kẻ thù. Khi bị dồn vào đường cùng chúng giả chết và tiết ra mùi hôi nhằm đánh lừa. Thông thường loài rắn ăn đêm này được tìm thấy dưới các đống đổ nát, đống củi khúc và các nơi tương tự trong rùng rậm có độ cao lên tới 1.000m', NULL, 'Gia Lai (Chư Sê), Sông Bé (Lai Khê, Thủ Dầu Một), Tây Ninh, Đồng Nai (Biên Hoà), thành phố Hồ Chí Minh, Kiên Giang (Hà Tiên), Bà Rịa – Vũng Tàu (Côn Đảo) Loài này phân bố trên khắp Thái Lan, phía Bắc bán đảo Malaysia, Tenasserim và phía Nam Đông Dương.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4817, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Elapidae', 'Rắn Hổ', 'FAM_128', 'Hemibungarus', NULL, 'GEN_0845', 'hemibungaruskelloggi', 'Hemibungarus kelloggi', 'Pope, 1928', 'Rắn lá khô đầu chữ V', 'SPA_04870', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4818, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Elapidae', 'Rắn Hổ', 'FAM_128', 'Hemibungarus', NULL, 'GEN_0845', 'hemibungarusmacclelandi', 'Hemibungarus macclelandi', 'TAYLOR, 1922', 'Rắn lá khô thường', 'SPA_04871', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4819, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Elapidae', 'Rắn Hổ', 'FAM_128', 'Naja', NULL, 'GEN_1286', 'najaatra', 'Naja atra', 'CANTOR, 1842            ', 'Rắn hổ mang', 'SPA_04872', 'Rắn độc có cỡ lớn nhất dài khoảng 3 - 4m, có khi đạt tới 5m. Có khả năng bạnh cổ, nhưng không bạnh to được bằng rắn hổ mang thường. Đầu tương đối ngắn, hơi dẹp, ít nhiều phân biệt so với cổ. Thân mảnh, thuôn nhỏ dần về phía sau, đuôi dài. Lưng rắn trưởng thành có màu vàng lục hay nâu, nhiều khi có màu đen chì. Đỉnh đầu có một vảy hình tam giác, đỉnh tam giác hướng về phía đuôi. Cá thể non có lưng màu đen với nhiều vạch ngang sáng, ở cổ có hoa văn hình chữ V ngược màu vàng nhạt.\n\nSinh học, sinh thái:\n\nThường sống ở trung du và miền núi, sống trong rừng, đồi cây, thậm chí trong bụi tre làng, sống trong những hang dưới những gốc cây lớn trong rừng, bên bờ suối. Chúng leo cây và bơi rất giỏi, nhưng thường sống ở mặt đất. Kiếm ăn cả ban ngày lẫn ban đêm, thức ăn chủ yếu gồm những loài rắn khác hoặc đôi khi cả những loài thằn lằn. Hổ chúa đẻ khoảng 20 - 30 trứng/lứa vào khoảng tháng 4, tháng 5, trong tổ có nhiều lá cây hay mảnh thực vật, trứng được cả rắn bố và rắn mẹ canh giữ. Rắn sơ sinh dài khoảng 40 - 50cm màu đen, thân có nhiều cạp màu vàng, cổ có hoa văn hình chữ V ngược màu vàng. Rắn hổ chúa là loài rắn độc thần kinh dữ tợn, rất nguy hiểm và chủ động tấn công người. Khi tấn công chúng thường dựng phần trước cơ thể. Chiều cao phần dựng của chúng phụ thuộc vào kích thước và chiều dài của chúng..', NULL, 'Trong nước: Cao Bằng, Lào Cai, Vĩnh Phúc, Hà Tây, Phú Thọ, Bắc Giang, Quảng Ninh, Ninh Bình, Hà Tĩnh, Quảng Bình, Đắk Lắk, Lâm Đồng, Phú Yên, Ninh Thuận, Gia Lai, Kontum, Tây Ninh, Đồng Nai, Bà Rịa - Vũng Tàu.\n\nThế giới: Bănglađét, Đông Ấn Độ, Nêpan, Mianma, Nam Trung Quốc, Lào, Thái Lan, Cămpuchia, Malaixia, Indonesia (Sumatra, Java, Borneo) và Philippin.', NULL, NULL, NULL, 'CR A1c,d.', NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=50&loai=1&img=1&ID=5062'),
(4820, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Elapidae', 'Rắn Hổ', 'FAM_128', 'Naja', NULL, 'GEN_1286', 'najakaouthia', 'Naja kaouthia', 'Lesson, 1831            ', 'Rắn hổ phì', 'SPA_04873', 'Rắn độc có kích thước lớn, khi rắn bạnh cổ, trên cổ ở mặt lưng có một hình tròn màu sáng (một mắt kính) chính giữa có một vết nâu đen. Ở cổ về mặt bụng có một cặp vết nhỏ nằm ngang. Màu sắc ở lưng đa dạng thay đổi từ màu nâu xẫm tới màu nâu xám. Đa số cá thể mặt lưng đồng màu. Một số ít cá thể có những vạch ngang hơi sáng song không rõ rệt. Ngoài ra, Rắn hổ mang đất còn có một số đặc điểm chi tiết phân biệt với Rắn hổ mang trung quốc. Rắn hổ đất hay rắn hổ mang một mắt kính thiếu gọng sống ở đồng bằng, trung du và miền núi. Hoạt động về ban đêm, ban ngày trú trong hang mối hoặc hang chuột nhiều trường hợp rất gần với nơi ở của con người. Rắn trưởng thành ăn chuột, cóc, rắn… rắn non ăn ếch nhái, lưỡng cư là chủ yếu. Rắn giao phối vào tháng 5 và đẻ trứng vào tháng 6, đẻ 9 – 22 trứng, kích thước 59 – 62 / 29 – 29mm và có hiện tượng con các canh giữ trứng. Trứng nở vào tháng 8. Con non mới nở dài 200 – 350mm và có khả năng bạnh cổ.. Con non mới nở dài 280 – 350mm, cũng thường dài hơn Rắn hổ mang trung quốc. Con non mới nở đã có thể bành cổ hung dữ và có nọc độc gây nguy hiểm cho người.', NULL, 'Trong nước: Phân bố chủ yếu ở miền Nam và Nam trung bộ. Ở miền Bắc Việt Nam rất hiếm gặp Thế giới: Bangladet, Bắc Ấn Độ, Nêpan, Nam Trung Quốc, Mianma, Lào, Thái Lan, Cambodia, Bắc Malaysia.', NULL, NULL, 'Là loài có giá trị khoa học. Rắn hổ mang là loài rắn độc cắn chết người. Tuy nhiên nọc độc của chúng cũng được dùng làm thuốc chữa đau các khớp xương, tê thấp, còn dùng làm thuốc tê.', NULL, NULL, NULL, 'Agriviet'),
(4821, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Elapidae', 'Rắn Hổ', 'FAM_128', 'Naja', NULL, 'GEN_1286', 'najasiamensis', 'Naja siamensis', 'Laurenti, 1768.', 'Rắn hổ mang thái lan', 'SPA_04874', 'Rắn độc có kích trung bình, khi rắn bạnh cổ, cơ thể khá dày, có thể phun nọc độc được. Màu sắc cơ thể của loài này có thể thay đổi từ màu xám sang màu nâu đen, với các đốm trắng hoặc sọc, các đốm trắng có thể phủ hầu hết thân ở cá thể chưa trưởng thành. Con trưởng thành có màu đồng nhất, chiều dài trung bình dài 0,9 đến 1,2m và có thể tối đa 2m. Đầu rộng và hơi dẹp, không phân biệt với cổ, có một đôi móc độc nằm ở hàm trên, đầu có thể dựng lên được và có thể phun nọc độc đến 2m. Những cá thể sống ở khu vực nhiều nắng, phân lưng có màu vàng lục. Khi gặp kẻ thù chúng thường phát ra tiếng kêu phì phì như mèo nên dân gian gọi là Rắn hổ mèo Rắn hổ mèo sống chủ yếu ở các vùng đất thấp, đất ngập nước. Hoạt động về ban đêm, ban ngày trú trong hang mối hoặc hang chuột nhiều trường hợp rất gần với nơi ở của con người. Rắn trưởng thành ăn chuột, cóc, rắn... rắn non ăn ếch nhái, lưỡng cư là chủ yếu. Rắn giao phối vào tháng 5 và đẻ trứng vào tháng 6, đẻ 10 - 20 trứng, kích thước 59 - 62 / 29 - 29mm và có hiện tượng con các canh giữ trứng. Trứng nở vào tháng 8. Con non mới nở dài 200 - 350mm và có khả năng bạnh cổ.. Con non mới nở dài 280 - 350mm. Con non mới nở đã có thể bành cổ hung dữ và có nọc độc gây nguy hiểm cho người. Gây đau, sưng nề, thường có liệt cơ, khó thở. Mờ mắt, sụp mí mắt và buồn ngủ do  chất độc tác động vào hệ thần kinh trung ương', NULL, 'Trong nước: phân bố ở phía Nam Việt Nam gồm Tây Ninh, Đồng Nai, thành phố Hồ Chí Minh, An Giang, Tiền Giang, Kiên Giang, Vĩnh Long, Sóc Trăng, Cà Mau. Số liệu ghi nhận ở TP HCM cho thấy các nạn nhân bị loài rắn này cắn chỉ tập trung tại một số tỉnh như Tiền Giang, Kiên Giang, Vĩnh Long, Sóc Trăng, Cà Mau. Thế giới: Thái Lan, Cambodia.', NULL, NULL, 'Là loài có giá trị khoa học. Rắn hổ mang là loài rắn độc cắn chết người. Tuy nhiên nọc độc của chúng cũng được dùng làm thuốc chữa đau các khớp xương, tê thấp, còn dùng làm thuốc tê.', NULL, NULL, NULL, 'VnCreature'),
(4822, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Elapidae', 'Rắn Hổ', 'FAM_128', 'Naja', NULL, 'GEN_1286', 'najasp', 'Naja sp.', NULL, 'Rắn hổ mang', 'SPA_04875', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
