 Nọc rắn có giá trị dược liệu chữa bệnh và thương phẩm, nếu tổ chức nuôi theo mô hình trang trại, thuần dưỡng.', 'CR', NULL, NULL, 'VnCreature'),
(4824, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Elapidae', 'Rắn Hổ', 'FAM_128', 'Ophiophagus', NULL, 'GEN_1379', 'ophiophagussp', 'Ophiophagus sp.', NULL, 'Rắn hổ mang', 'SPA_04877', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4825, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Elapidae', 'Rắn Hổ', 'FAM_128', 'Sinomicrurus', NULL, 'GEN_1825', 'sinomicruruskelloggi', 'Sinomicrurus kelloggi', '(Pope, 1928)', 'Rắn lá khô đầu hình V', 'SPA_04878', ' có 15 hàng vảy, không có đường dọc trên cơ thể và đầu khá khác biệt với cổ', NULL, 'Trung Quốc (đảo Hải Nam), Lào (Khammouan), Việt Nam (Quảng Ninh, Nghệ An); Loại địa phương: rìa rừng trên con đường gần rãnh nước bên hồ Tianchi, Jianfengling NNR, đảo Hải Nam, Hải Nam, Trung Quốc', NULL, NULL, NULL, NULL, NULL, NULL, 'https://reptile-database.reptarium.cz/species?genus=Sinomicrurus&species=kelloggi'),
(4826, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Elapidae', 'Rắn Hổ', 'FAM_128', 'Sinomicrurus', NULL, 'GEN_1825', 'sinomicrurusmacclellandi', 'Sinomicrurus macclellandi', '(Reinhardt, 1844)            ', 'Rắn lá khô thường', 'SPA_04879', 'Loài rắn nhỏ có kích thước trung bình khoảng 40 - 60cm chiều dài, một vài cá thể dài đến 80cm. Đầu của loại rắn nhiều màu sắc này màu đen; phía sau mắt có một dải màu ngà voi rộng và kế tiếp là một dải màu đen rộng. Thân màu đỏ nhạt, trên lưng có từ 23 đến 40 khoanh màu đen hẹp vắt ngang, vài khoanh không hoàn chỉnh phía bên hông thân. Đuôi có từ hai đến sáu vạch màu đen. Cằm rắn màu kem; phần bụng màu vàng nhạt có những vệt đen. Loài rắn ăn đêm này thường săn các loài rắn khác và thằn lằn và thường sống ở nơi đất thấp ở các khu vực rừng thường xanh núi cao có độ cao trên 1.000m. Sống chhui rúc dưới những đám thảm mục thực vật trong rừng. Loài này có độc tố, khi bắt con mồi  nọc độc thần kinh sẽ làm tê liệt con mồi trước khi nuốt. Mặc dù là loài rắn rất hiền lành nhưng chúng sở hữu một chất độc thần kinh mạnh. Đã ghi nhận nọc độc của chúng gây ra một vài trường hợp tử vong  ở Thái Lan.\nLoài này thường sinh sản vào cuối mùa mưa và con cái đẻ từ 10  - 14 trứng. Trướng được vùi trong lớp thảm mục thực vật trong rừng.', NULL, ' Cao Bằng (Ngân Sơn), Lào Cai (Sapa), Bắc Thái (Bắc Kạn, Ký Phú), Lạng Sơn Vĩnh Phú (Khả Cửu, Tam Đảo), Hà Tây (Ba Vì), Thừa thiên Huế, Lâm Đồng (Đà Lạt).  Rắn lá khô thường có mặt trên khắp phía Đông các đồi ở chân núi Himalaya, và phân bố tại các vùng phía Bắc và Nam Thái Lan, Nêpan, Ấn Độ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(4827, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Cosymbotus', NULL, 'GEN_0478', 'cosymbotusplatyurus', 'Cosymbotus platyurus', 'Schneider, 1792', 'Thạch sùng đuôi dẹp', 'SPA_04880', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4828, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Crytodactynus', NULL, 'GEN_0497', 'crytodactynusirregularis', 'Crytodactynus irregularis', '(Smith, 1921)', 'Thạch sùng ngón không đều ', 'SPA_04881', 'Ngoài hoa văn tuyệt đẹp gồm những đường kẻ mắt lưới màu vàng hoặc màu nâu hồng nhạt đứng tách rời các cặp đốm tròn lớn màu đen hoặc nâu đậm trên đầu và lưng là một dải màu sẫm xung quanh phía sau đầu, loài bò sát này được nhận biết bởi các vảy mở rộng dưới đuôi và bảy đến chín lỗ trước hậu môn được bố trí ở một góc rộng.', NULL, 'Việt Nam: Gia Lai (Sơklang, xã Nam), Đắc Lắc (Đạo Nghĩa), Lâm Đồng (Đà Lạt, Langbiang) Thế giới: phía Tây và bán đảo phía Nam Thái Lan tới Phatthalung, ở Pegu và Tenasserim thuộc Myanmar.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4829, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Cyrtodactylus', NULL, 'GEN_0539', 'cyrtodactylusbugiamapensis', 'Cyrtodactylus bugiamapensis', 'Nazarov, Poyarkov, Orlov, Phung, Nguyen, Hoang & Ziegler, 2012', 'Thạch sùng ngón Bù Gia Mập', 'SPA_04882', 'Kích cỡ trung bình. SVL (chiều dài thân): 58.6 - 76.8 mm. Chiều dài đuôi 65. 3 - 85.0 mm. Thân mảnh, chân và ngón không dài lắm. Đuôi khá mảnh, dài hơn thân. Lưng màu vàng nhạt đến nâu nhạt (mẫu ngâm có màu be nhạt đến nâu) với các vạch ngang không dứt khoát hình thành bởi các vạch hơi tròn đến hình chữ nhật không đều nhau và các đốm nâu đen. Cổ có một vạch hẹp tối màu hình chữ U (có thể bị đứt đoạn ở giữa) kéo dài qua tai đến mắt. Mặt trên của đầu có vài đốm tối màu không đều nhau. Các vạch tối màu trên lưng đều có viền trắng. Đuôi có 8 - 11 vạch ngang tối màu, nhạt dần về mặt dưới đuôi. Có hai cặp vảy sau cằm lớn, kích thước cặp thứ hai bằng khoảng một nửa cặp thứ nhất. Mũi tròn, được viền quanh bởi vảy trước mũi, vảy mõm, vảy môi trên thứ nhất và 3 (hiếm khi là 4) vảy sau mũi nhỏ. Nốt sần trên lưng lớn, nhọn, hóa sừng nhiều, gồm 20 - 24 hàng dọc không đều nhau. Nếp gấp bên sườn ít phát triển. 36 - 46 vảy bụng giữa hai nếp gấp bên sườn. 164 - 205 vảy từ vảy sau cằm đến huyệt. 7 - 11 lỗ trước huyệt xếp thành dải hình chữ V ngược ở con đực. Không có rãnh trước huyệt và lỗ đùi. Vảy dưới đuôi đồng đều, không nở rộng thành tấm ngang, lớn hơn vảy bên đuôi. Số nếp da trung bình dưới ngón chân trước thứ tư là 15. 9 và dưới ngón chân sau thứ tư là 18. 3.', NULL, 'Loài đặc hữu của Việt Nam, mới phát hiện ở Bình Phước (Vườn quốc gia Bù Gia Mập). Tại sườn núi quanh khu vực suối thuộc suối Dakka, tỉnh Bình Phước', NULL, 'Bình Phước', NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=6115'),
