(4832, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Cyrtodactylus', NULL, 'GEN_0539', 'cyrtodactyluscucphuonggensis', 'Cyrtodactylus cucphuonggensis', 'NGO & ONN, 2011', 'Thạch sùng ngón vằn lưng', 'SPA_04885', 'chiều dài thân vào khoảng 96mm; không có lỗ thải và lỗ chân lông ở đùi; có 19 bản mỏng dưới ngón chân đầu tiên và 24 bản mỏng dưới ngón chân thứ tư; đỉnh đầu xuất hiện nhiều đốm đen lớn; gáy rộng lồi lên; phần thân trên giữa hai chi có 5 – 6 vạch đen rộng, không đều. ', NULL, ' ', NULL, 'Loài đặc hữu của Cúc Phương', NULL, NULL, NULL, NULL, 'Thiennhien.net'),
(4833, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Cyrtodactylus', NULL, 'GEN_0539', 'cyrtodactylusirregularis', 'Cyrtodactylus irregularis ', '(Smith, 1921)', 'Thạch sùng ngón vằn lưng', 'SPA_04886', 'Ngoài hoa văn tuyệt đẹp gồm những đường kẻ mắt lưới màu vàng hoặc màu nâu hồng nhạt đứng tách rời các cặp đốm tròn lớn màu đen hoặc nâu đậm trên đầu và lưng là một dải màu sẫm xung quanh phía sau đầu, loài bò sát này được nhận biết bởi các vảy mở rộng dưới đuôi và bảy đến chín lỗ trước hậu môn được bố trí ở một góc rộng.', NULL, 'Việt Nam: Gia Lai (Sơklang, xã Nam), Đắc Lắc (Đạo Nghĩa), Lâm Đồng (Đà Lạt, Langbiang)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5917'),
