(4837, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Dixonius', NULL, 'GEN_0596', 'dixoniusvietnamensis', 'Dixonius vietnamensis', 'Das, 2004', 'Thạch sung lá việt nam', 'SPA_04890', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4838, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Gehyra', NULL, 'GEN_0745', 'gehyramutilata', 'Gehyra mutilata', '(Wiegmann, 1834)       ', 'Thạch sùng cụt', 'SPA_04892', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4839, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Gekko', NULL, 'GEN_0747', 'gekkochinensis', 'Gekko chinensis', '(Gray, 1842)', 'Tắc kè Trung Quốc', 'SPA_04893', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4840, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Gekko', NULL, 'GEN_0747', 'gekkogecko', 'Gecko gecko', '(Linnaeus, 1758)', 'Tắc Kè', 'SPA_04894', 'Cơ thể có cỡ trung bình. Đầu dẹp gần với hình tam giác phủ vẩy dạng hạt. Mí mắt là một màng trong suốt phủ lên cầu mắt (do đó có cảm giác như thiếu mi mắt), con ngươi dọc. Lưng có nhiều nốt sần lớn. Chân có năm ngón có vuốt (trừ ngón cái), ngón chân nở rộng, dưới các ngón có những bản mỏng nằm theo chiều ngang có tác dụng như giác bám, nhờ đó con vật có thể leo trên vách đá dựng đứng hoặc trên trần nhà. ở mặt dưới mỗi bên đùi thấy rất rõ ở cá thể đực một hàng vảy có lỗ (lỗ trước huyệt). Hai hàng vảy có lỗ trước huyệt này ở mặt dưới mỗi bên đùi xếp theo hình chữ V ngược, bao giờ cũng gồm từ 9 đến 19 lỗ. ở cá thể cái không có các lỗ trước huyệt. Mặt lưng màu xám nhạt, có nhiều chấm sáng hay vàng nhạt. Mặt bụng có mầu trắng đục, đôi khi có những chấm vàng nhỏ. Đuôi có những khúc xám đen xen với các khúc vàng nhạt, rất rõ ở cá thể non Trong tự nhiên, sống trong hốc cây, khe đá. Trong nhà dân chúng sống trong khe hoặc trong các hốc tường dưới mái nhà. Ăn sâu bọ, côn trùng kiếm mồi vào lúc chập tối, đến nửa đêm. Nhiệt độ thích hợp 24 - 31oC. Mùa giao phối vào tháng 4, ứng với thời gian tắc kè đực kêu nhiều. Tắc kè cái có thể đẻ 1 - 3 lứa/năm; lứa thứ nhất cách lứa thứ hai một tháng, lứa thứ hai cách lứa thứ ba khoảng 12 ngày; thường đẻ vào tháng 5 đến tháng 7 đôi khi tháng 8. Thường đẻ 2 trứng/lứa. Trứng có vỏ đá vôi, thoạt đầu vỏ còn mềm tiết chất dính, dính chặt trứng vào giá thể. Thời gian trứng nở kéo dài từ 81 đến 85 ngày. Tắc kè mới nở dài 84 - 106m, nặng 2,6 - 4,6g. Tắc kè lột xác 9 - 12 lần/năm', NULL, 'Tắc kè phân bố ở hầu hết các tỉnh trung du và miền núi, thậm chí có cả ở các vùng đồng bằng trong cả nước Bănglađét, ấn Độ, Nêpan, Trung Quốc, Lào, Thái Lan, Cămpuchia, Malaixia, Philippin, Inđônêxia', NULL, NULL, 'Tắc kè được coi là vị thuốc chữa các chứng ho và chữa suy nhược thần kinh đau ngang thắt lưng, đồng thời có tác dụng bổ. Trước đây vào những năm 60 của thế kỉ XX khi Tắc kè trong tự nhiên còn nhiều, được xuất sang Trung Quốc. Tắc kè ăn côn trùng nên có lợi cho lâm, nông nghiệp', ' VU A1 c,d', 'LC', NULL, 'VnCreature'),
(4841, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Gekko', NULL, 'GEN_0747', 'gekkojaponicus', 'Gekko japonicus', '(Schlegel, 1836)', 'Tắc kè nhật bản', 'SPA_04895', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4842, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Gekko', NULL, 'GEN_0747', 'gekkopalmatus', 'Gekko palmatus', 'Boulenger, 1907       ', 'Tắc kè chân vịt', 'SPA_04896', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4843, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Gekko', NULL, 'GEN_0747', 'gekkoreevesii', 'Gekko reevesii', '(Gray, 1831)            ', 'Tắc kè reevesi', 'SPA_04897', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4844, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Gekko', NULL, 'GEN_0747', 'gekkosp', 'Gekko sp.', NULL, 'Tắc kè', 'SPA_04898', 'Hầu hết các loài trong chi Tắc kè đều có đuôi dài, thân phủ vảy, chân có màng giác bám thích hợp cho việc leo trèo, mắt có con ngươi mở rộng trong bóng tối. Thức ăn chủ yếu là các loài côn trùng nhỏ, ngoài ra một số loài còn ăn cả trái cây, các động vật có vú và bò sát nhỏ. Các loài trong chi sống chủ yếu ở các vùng rừng ẩm ướt, sinh hoạt về đêm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://vi.wikipedia.org/wiki/Chi_T%E1%BA%AFc_k%C3%A8'),
(4845, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Goniurosaurus', NULL, 'GEN_0780', 'goniurosauruscatbaensis', 'Goniurosaurus catbaensis', 'Thomas Ziegler et al., 2008', 'Thạch sùng mí cát bà', 'SPA_04899', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4846, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Hemidactylus', NULL, 'GEN_0849', 'hemidactylusbowringii', 'Hemidactylus bowringii', '(Gray, 1845)', 'Thạch sùng bao rin', 'SPA_04900', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4847, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Hemidactylus', NULL, 'GEN_0849', 'hemidactylusfrenatus', 'Hemidactylus frenatus', 'Schlegel, 1836            ', 'Thạch sùng đuôi sần', 'SPA_04901', 'Đặc điểm nhận dạng:\nDài thân: 45 - 63mm, dài đuôi: 45 - 68mm. Đầu và thân phủ vảy hạt nhỏ đồng dạng, vảy ở mõm lớn hơn vảy trên đầu và trên thân một chút, xếp cạnh nhau. Vảy họng hình hạt xếp cạnh nhau. Vảy ở ngực, bụng và dưới đùi có dạng tròn, lớn hơn vảy trên thân, xếp gối lên nhau. Vảy xung quanh khe huyệt bé. Tấm mõm hình chữ nhật, rộng hơn cao 1,6 lần.Tấm cằm hình tam giác, mép viền ngoài rộng hơn tấm mõm. Có 2 cặp tấm sau cằm, cặp thứ nhất chạm tấm mép trên thứ nhất, cặp thứ hai tiếp xúc tấm thứ nhất và tấm thứ hai. Có 10 - 12 tấm mép trên, 7 - 9 tấm mép dưới ở mỗi bên. Có 5 bản mỏng dưới ngón I chi trước, 8 - 11 bản mỏng dưới ngón IV chi sau. Có 16 - 17 lỗ đùi ở mỗi bên. Đuôi tròn có các gai nhỏ xếp thành 6 dãy mấu dọc.\nMàu sắc đa dạng: Mặt trên màu xám đến đen, hoặc nâu sẫm, nâu nhạt, vàng nhạt đến trắng đục, có các vệt đen dọc theo thân đến gốc đuôi, hoặc có các vệt đen ngang thân; đôi khi là các đốm trắng xếp thành hàng dọc thân, hoặc không có hoa văn. Mặt dưới màu trắng đục.\nSinh học, sinh thái:\nKiếm ăn ban đêm, quanh các khu vực có gốc cây to hay tảng đá mẹ trong rừng thường xanh và đôi khi gặp sống ở các khu vực dân cư. Thức ăn là các loài ấu trùng sống trong khu vực sinh sống.', NULL, 'Việt Nam: Hầu khắp các tỉnh từ Lạng Sơn cho đến Cà Mau.\nThế giới: Hầu khắp các vùng Đông nam châu Á và Trung Quốc, Ấn Độ.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4848, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Hemidactylus', NULL, 'GEN_0849', 'hemidactylusgarnotii', 'Hemidactylus garnotii', '(Dumiril & Bibron,1863)', 'Thạch sùng đuôi dẹp', 'SPA_04902', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4849, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Hemidactylus', NULL, 'GEN_0849', 'hemidactyluskarenorum', 'Hemidactylus karenorum', '(THEOBALD, 1868)', 'Thạch sùng', 'SPA_04903', 'Chiều dài đầu và thân 50 mm.; đuôi 56 mm. Mũi dài hơn khoảng cách từ mắt đến lỗ tai, bằng 1 và 1/3 hoặc 1 và 2/5 đường kính hốc mắt; trán hơi lõm; lỗ tai nhỏ, tròn. Đầu có dạng hạt, hạt to ra ở mõm. Mặt lưng có bốn cạnh, cao không quá rộng gấp đôi, có khe hở ở giữa phía trên; lỗ mũi được bao quanh bởi mõm, môi thứ nhất và ba mũi. Mười một hoặc mười hai môi trên và bảy đến chín môi dưới; tinh thần lớn, hình tam giác; hai cặp chắn cằm, cặp ở giữa tiếp xúc. Cơ thể được bao phủ bởi các hạt nhỏ và nhiều nốt sần tròn lồi nhỏ; một nếp gấp nhẹ ở bên và một nếp gấp khác ở phía sau đùi. Các vảy bụng hình tròn, xếp chồng lên nhau. Nam giới có sáu lỗ chân lông tạo thành một chuỗi góc cạnh? (Con cái có sáu vảy to ở vùng quanh hậu môn). Đuôi cụp xuống, phẳng bên dưới, có cạnh bên có răng nhọn, phía trên phủ các vảy nhỏ bằng nhau, phía dưới có một loạt các tấm lớn giãn ngang ở giữa. Tay chân vừa phải; các ngón tự do, giãn ra, bên trong phát triển tốt; các lá mỏng kỹ thuật số cong, năm dưới ngón cái, chín dưới ngón thứ tư, 5 hoặc 6 dưới ngón chân thứ nhất, 10 hoặc 12 dưới ngón chân thứ tư.  Mặt trên có màu nâu xám nhạt, xen kẽ với màu nâu đậm hơn. Phần dưới màu trắng (de Rooij 1915: 30). sinh trứng', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'The reptarium database.'),
(4850, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Hemidactylus', NULL, 'GEN_0849', 'hemidactylusplatyurus', 'Hemidactylus platyurus', 'Schneider, 1797', 'Thạch sùng đuôi rèm', 'SPA_04904', 'Chiều dài thân: 53 - 57mm; chiều dài đuôi: 43 - 59mm Loài thạch sùng dễ nhận dạng bởi có nếp da bên thân từ nách đến bẹn rộng thành diềm rất rõ, chỗ rộng nhất khoảng 2 mm. Phía sau đùi và ống chân cũng có diềm da hẹp. Cơ thể dẹp, mõm hơi nhọn, đầu dài hơn rộng, hơi phân biệt với cổ. Lỗ mắt tròn, con ngươi hình elip thẳng đứng. Tấm mõm rộng hơn cao, phía sau lõm hình chữ V; 2 tấm trên mũi tiếp xúc với tấm mõm, cách nhau 1 - 2 vảy nhỏ. Lỗ mũi nằm giữa tấm mõm, tấm trên mũi, 2 tấm sau mũi và tấm mép trên thứ nhất. Tấm cằm hình tam giác, dài bằng rộng; có 2 cặp tấm sau cằm, cặp thứ nhất tiếp xúc nhau, cặp thứ 2 cách nhau bởi 1 - 2 vảy nhỏ. Có 10 - 11 tấm mép trên, 8 - 9 tấm mép dưới mỗi bên, được tiếp tục bởi các vảy nhỏ phía sau đến hết mép.\n\nĐầu và thân phủ vảy hạt nhỏ đồng dạng, xếp cạnh nhau, không có củ; vảy vùng đầu bé hơn vảy vùng trên thân một chút. Có 36 - 42 vảy trung gian giữa hai ổ mắt nơi hẹp nhất. Cằm và họng phủ vảy hạt, xếp cạnh nhau, lớn hơn vảy trên đầu và thân. Có 96 - 99 hàng vảy ngang lưng ở giữa thân (kể cả vảy ở hai nếp da bên thân). Vảy bụng nhẵn, phủ lên nhau hình ngói lợp. Có 28 - 30 hàng (ở cá thể đực), 36 hàng (ở cá thể cái) vảy ngang giữa bụng.\n\nĐuôi dẹp trên dưới rất rõ, phẳng ở phía dưới, hai bên có khía răng cưa. Tấm dưới đuôi rộng gấp hơn hai lần dài, tấm đầu tiên chia; có 39 - 40 tấm dưới đuôi ở cá thể đực và 50 tấm dưới đuôi ở cá thể cái, có 9 - 10 hàng vảy từ sau lỗ huyệt đến tấm dưới đuôi đầu tiên. Có 19 lỗ đùi - hậu môn mỗi bên ở cá thể đực. Chi dẹp, giữa các ngón có khoảng 1/4 đến 1/5 màng; mút các ngón đều có vuốt rõ. Có 4 - 6 bản mỏng dưới ngón I; 7 - 9 bản mỏng dưới ngón III và 7 – 9 bản mỏng dưới ngón IV chi trước. Có 5 bản mỏng dưới ngón I; 8 - 9 bản mỏng dưới ngón III; 7 - 9 bản mỏng dưới ngón IV chi. Kiếm ăn ban đêm quanh các khu vực có gốc cây to hay tảng đá mẹ trong rừng thường xanh và sống ở các khu vực dân cư, thành phố. Thức ăn là các loài ấu trùng sống trong khu vực sinh sống.', NULL, 'Thừa Thiên-Huế, Bà Rịa - Vũng Tàu, Bình Phước, Đắk Lắk, Đồng Nai, Tây Ninh, Thành phố Hồ Chí Minh, Kiên Giang. loài này đã được ghi nhận là có vùng phân bố rộng, từ Ấn Độ, Trung Quốc sang Đông Nam châu Á và các đảo trên Thái Bình Dương', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4851, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Hemidactylus', NULL, 'GEN_0849', 'hemidactylusvietnamensis', 'Hemidactylus vietnamensis ', 'Darevsky, Kupriyanova and Roshchin, 1984', 'Thạch sùng Việt Nam', 'SPA_04905', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4852, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Hemiphyllodactylus', NULL, 'GEN_0854', 'hemiphyllodactylusbanaensis', 'Hemiphyllodactylus banaensis', 'Ngo Van Tri, L.Lee Grismer, Pham Hong Thai & P.L Wood, JR, 2014', 'Thằn lằn chân nửa lá Bà Nà', 'SPA_04906', 'Loài thằn lằn có kích thước nhỏ, chiều dài đầu thân lớn nhất của con cái là 51 mm. Chiều dài từ mút mõm đến lỗ huyệt 48.2 mm ở con đực, 51 mm ở con cái. 7 vảy cằm trải ngang từ điểm nối vảy môi dưới thứ nhất và thứ hai và mép sau của vảy cằm. Vảy sau cằm nở rộng. 3 vảy quanh mũi. 4 - 11 vảy giữa những vảy trên mũi. 9 - 12 vảy môi trên. 9 - 11 vảy môi dưới. 18 - 20 vảy xếp dọc lưng giữa thân. 9 - 12 vảy bụng xếp dọc giữa thân. Công thức màng da dưới bàn chân trước 3 (II), 4 - 5 (III), 4 - 5 (IV), 4 (V), dưới bàn chân sau 4 (II), 5 (III), 5 (IV), 5 (V). 20 - 21 vảy sinh lỗ đùi và trước huyệt, kề nhau ở con đực. 0 - 20 vảy trước huyệt sinh lỗ kề nhau ở con cái. Hoa văn lưng trên thân có vằn cạch ngang và hai sọc trắng qua vai trải rộng đến xương cùng, vết sau xương cùng màu nâu trắng và chạy đến trước cánh chân trước. Manh tràng và vòi trứng không màu.', NULL, 'Loài mới phát hiện và công bố năm 2014 ở Khu bảo tồn thiên nhiên Bà Nam, Quảng Nam - Đà Nẵng. Tên loài được đặt theo khu vực phát hiện loài ở Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=6206'),
(4853, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Hemiphyllodactylus', NULL, 'GEN_0854', 'hemiphyllodactyluschapaensis', 'Hemiphyllodactylus chapaensis', '(Bourret, 1937)', 'Thạch tùng nửa lá Sa Pa', 'SPA_04907', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4854, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Hemiphyllodactylus', NULL, 'GEN_0854', 'hemiphyllodactylustypus', 'Hemiphyllodactylus typus', 'Bleeker, 1860', 'Thạch sùng nửa lá Sa Pa', 'SPA_04908', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4855, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Ptychozoon', NULL, 'GEN_1686', 'ptychozoonlionotum', 'Ptychozoon lionotum', '(Annandale, 1905)', 'Thạch sùng đuôi thuỳ', 'SPA_04909', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4856, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Gekkonidae', 'Tắc Kè', 'FAM_155', 'Ptychozoon', NULL, 'GEN_1686', 'ptychozoontrinotatera', 'Ptychozoon trinotatera', 'Brown, 1999', 'Thạch sùng đuôi thùy ', 'SPA_04910', 'Chiều dài đuôi: 10cm, chiều dài tổng cộng: 25cm. Loài thạch sùng này rất giống thạch sùng đuôi ba thùy Ptychozoon trinotaterra nhưng nhỏ hơn và các riềm đuôi hơi hướng về phía sau, không có các nốt sần lớn trên lưng, và ngón chân trước đầu tiên tách hẳn khỏi lớp da dọc theo cẳng tay. Thân mảnh hơn và ít hoa văn hơn. Đuôi của chúng hai bên có hình răng cưa và được xẻ sâu với 9 - 15 răng cưa. Ở những cá thể bị đứt đuôi tái sinh lại hầu như không thấy phần răng cưa xuất hiện. Đây là loài hoạt động về đêm và thường sống chung với các loài thạch sùng khác. Thỉnh thoảng gaặp chúng nghỉ trên thân cây vào ban ngày. Khi bị rượt đuổi, chúng thường nhảy xuống và dùng cánh da để bay qua cây khác, hoặc ít nhất là tránh cho khỏi ngã, Thức ăn của loài này chưa được xác định nhưng có thể thức ăn của chúng là các loài côn trùng nhỏ.', NULL, 'Loài này có vùng phân bố hẹp ở Myanmar, Việt Nam, Borneo và ở nước ta đã gặp chúng ở Trảng Bom - Đồng Nai, Kiên Giang - Phú Quốc.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4857, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Homalopsidae', 'Rắn Ri', 'FAM_188', 'Erpeton', NULL, 'GEN_0671', 'erpetontentaculatum', 'Erpeton tentaculatum', 'Lacépède, 1800', 'Rắn râu ', 'SPA_04911', 'Đặc điểm nhận dạng:\nLoài rắn có kích thước nhỏ. Đầu dẹt trước đầu có 2 sợ râu dài 1cm với các vảy mềm, vảy thân gồ lên rất nhiều và bụng rất nhỏ. Màu sắc và hoa văn hay biến đổi; Thường trên thân có các đốm màu nâu sậm. Mặt trên bụng có màu nâu vàng ở những nơi nước ngọt phẳng lặng có môi trường axit. Một số cá thể có màu vàng nhạt với các sọc mờ ở hai bên sườn vả hai sọc mảu đen chạy dọc phần lưng.\n\nNơi sống, sinh thái:\nLoài rắn này sống ở đồng bằng, đất ngập nước nơi có nhiều ao hồ và đầm lầy chúng thường hoạt động kiếm ăn vào ban ngày. Thường nằm bất động xúc tu kéo ngang mõm được sử dụng để nhử mồi và chờ săn những con mồi nhỏ gồm cá, tôm và các con mồi khác đến gần chúng. Mỗi lứa đẻ từ 5 - 1 3 con; rắn con dài từ 20 - 24 cm và giống như rắn truởng thành.', NULL, 'Trong nước: Sông Bé (Thủ dầu Một), Tây Ninh, Long An (Tân Thạnh, Long An), Kiên Giang (Hà Tiên)\nNước ngoài: Miền Trung phiá Nam bán đảo Thái Lan, cũng như Campuchia và Malaysia', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4858, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Homalopsidae', 'Rắn Ri', 'FAM_188', 'Hypsiscopus', NULL, 'GEN_0943', 'hypsiscopusplumbea', 'Hypsiscopus plumbea', '(Boie, 1827)            ', 'Rắn bồng chì', 'SPA_04912', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4859, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Hydrophiidae', 'Rắn Biển', 'FAM_190', 'Hydrophis', NULL, 'GEN_0917', 'hydrophiscyanocinctus', 'Hydrophis cyanocinctus', 'Daudin, 1803', 'Đẻn khoanh đầu vàng', 'SPA_04913', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4860, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Hydrophiidae', 'Rắn Biển', 'FAM_190', 'Hydrophis', NULL, 'GEN_0917', 'hydrophisfasciatus', 'Hydrophis fasciatus', '(Schneider, 1799)', 'Đẻn cạp nong', 'SPA_04914', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4861, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Lacertidae', 'Thằn Lằn Chính Thức', 'FAM_206', 'Platyplacopus', NULL, 'GEN_1580', 'platyplacopuskuehnei', 'Platyplacopus kuehnei', 'Gressitt, 1938. ', 'Liu điu cuni', 'SPA_04915', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4862, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Lacertidae', 'Thằn Lằn Chính Thức', 'FAM_206', 'Takydromus', NULL, 'GEN_1905', 'takydromushani', 'Takydromus hani', 'Chou, Truong & Pauwels, 2001', 'Liu điu xanh', 'SPA_04916', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4863, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Lacertidae', 'Thằn Lằn Chính Thức', 'FAM_206', 'Takydromus', NULL, 'GEN_1905', 'takydromuskuehnei', 'Takydromus kuehnei van', 'Denburgh, 1909', 'Liu điu kuc-ni', 'SPA_04917', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4864, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Lacertidae', 'Thằn Lằn Chính Thức', 'FAM_206', 'Takydromus', NULL, 'GEN_1905', 'takydromussexlineatus', 'Takydromus sexlineatus', 'Daudin, 1802', 'Liu điu chỉ', 'SPA_04918', 'Loài thằn lằn cỡ nhỏ, dài đuôi dài gấp sáu lần chiều dài thân. Dài thân 30 - 60mm, dài đuôi 160 - 180mm. Mõm nhọn, tấm mõm rộng. Hai tấm trán ở đỉnh tiếp xúc với nhau, rộng và ngắn hơn tấm trước trán. Tấm đỉnh lớn, cách nhau rõ bởi tấm gian đỉnh và tấm chẩm bé hơn. Có 2 - 3 tấm thái dương chạm tấm đỉnh.Các vảy vùng thái dương nổi gờ rất rõ. Có 3 cặp tấm sau cằm.\n\nThân có 6 hàng vảy dọc, rộng, nổi gờ rõ, 4 hàng vảy ở giữa tiếp tục kéo dài đến đuôi. Vảy bên thân bé, có 12 hàng vảy rộng ở bụng, các vảy này cũng nổi gờ rõ. Từ nếp gấp vai đến bẹn có 26 vảy. Tấm hậu môn lớn và có 2 vảy dài, bé hơn nằm ở hai bên.Ở con đực và con cái đều có 1 lỗ đùi ở mỗi bên. Mép trên có từ 6  -8 tấm vảy và 5 - 8 tấm ở mép dưới mỗi bên.\n\nThân màu xanh xám đến nâu xám, phần đầu có màu thẫm hơn. Cằm và cổ họng có màu trắng đục đến hơi vàng. Mặt trên của các chi và phần sau của gốc đuôi màu xám nhạt. Ở các cá thể đực có một dải hẹp màu trắng xám chạy từ góc sau tấm đỉnh đến giữa thân và mờ dần về phía đuôi. Từ vai đến bẹn là các đốm trắng xám nhỏ hình bầu dục xếp thành hàng dọc Đây là loài bò sát của các khu vực có nhiều cỏ. Ngụy trang hình dạng của nó rất tài tình, vẻ ngoài và hoa văn lẫn màu sắc của nó hợp với màu cỏ khô, Đuôi dài giúp nó khỏi ngã khi leo trèo chậm hoặc di chuyển nhanh qua các chỗ cỏ cao, rậm, nối lìền nhau hoặc nơi cỏ đan vào nhau rời rạc và các nhánh tre nhỏ. Nó linh hoạt khi trời nắng nhiều và sống ở nơi có độ cao tới 1.500m. Con cái đẻ 2 hoặc 3 trứng trên đất, đặt trứng ở gốc của những khóm cỏ hoặc các loài thực vật khác.Thức ăn chính của chúng được biết đến là các loài côn trùng đất.', NULL, 'Việt Nam: Vĩnh Phú (Đại Đỉnh, Khả Cửu, Mỹ Lương, Tam Đảo, Xuân Sơn), Hoà Bình (An Lạc, Thượng Tiến, Tu Lý), Hà Bắc, Ninh Bình (Cúc Phương), Kontum, Gia Lai, Đắc Lắc, Sông Bé, Đồng Nai (Cát Tiên, Biên Hoà) Thế giới: phân bố khắp Đông nam châu Á và xa hơn, từ Assam tới Hồng Kông, Ấn Độ, Đài Loan, Trung Quốc, sang đảo Sumatra, Java và Borneo.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4865, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Lacertidae', 'Thằn Lằn Chính Thức', 'FAM_206', 'Takydromus', NULL, 'GEN_1905', 'takydromuswolteri', 'Takydromus wolteri', 'Fischer, 1885            ', 'Liu điu Volte', 'SPA_04919', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4866, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Dasia', NULL, 'GEN_0550', 'dasiaolivacea', 'Dasia olivacea', 'Gray, 1839', 'Thằn lằn đa-si xanh', 'SPA_04920', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4867, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Eumeces', NULL, 'GEN_0685', 'eumeceselegans', 'Eumeces elegans', '(E.quadrilineatus)', 'Thằn lằn Emô đuôi xanh (Thằn lằn Eme chỉ)', 'SPA_04921', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4868, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Eumeces', NULL, 'GEN_0685', 'eumecesquadrilineatus', 'Eumeces quadrilineatus', '(Byth, 1853)', 'Thằn lằn Eme chỉ', 'SPA_04922', 'Tấm mõm rộng bằng hai lần cao; 2 tấm trên mũi chạm nhau và chạm tấm sau mũi. Lỗ mũi ở giữa tấm mũi. Có 1 tấm sau mũi; 2 tấm má nằm trên tấm mép trên thứ nhất và thứ hai. Tấm trán - mũi nguyên, phía bên tiếp xúc với tấm má thứ nhất. Có 2 tấm trước trán, đường nối giữa chúng bé hơn chiều dài tấm trán mũi, phía bên tiếp xúc với cả 2 tấm má. Tấm trán dài hơn 2 lần rộng, dài hơn khoảng cách từ nó đến tấm mõm; phía bên tiếp xúc với tấm trên ổ mắt thứ nhất, thứ hai và một phần tấm thứ ba. Có 2 tấm trán đỉnh rộng hơn tấm gian đỉnh, tương đương tấm trước trán; tấm trán đỉnh tiếp xúc với tấm trên ổ mắt thứ ba và thứ tư ở phía bên, phía sau tiếp xúc tấm gian đỉnh và tấm đỉnh.\n\nTấm gian đỉnh nằm giữa 2 tấm đỉnh và 2 tấm trán đỉnh. Tấm đỉnh lớn, gấp 2 lần tấm gian đỉnh. Có 3 cặp tấm gáy dài. Có 2 tấm trước dưới ổ mắt; 6 tấm trên mi; 4 tấm trên ổ mắt; 1 tấm sau trên ổ mắt; 1 tấm sau mắt và 3 tấm sau dưới ổ mắt. Có 7 tấm mép trên, tấm thứ 7 lớn nhất, tấm thứ 5 tiếp xúc ổ mắt; 6 - 7 tấm mép dưới ở mỗi bên. Tấm cằm rộng gấp 2 lần dài, viền tấm cằm lớn hơn tấm mõm. Có 2 tấm sau cằm lẻ, tấm sau lớn hơn tấm trước một chút.\n\nVảy thân nhẵn. Có 22 hàng vảy bao quanh thân; 45 - 46 vảy dọc lưng từ sau tấm gáy đến ngang với trước gốc đùi; 57 vảy dọc bụng từ sau tấm cằm lẻ đến trước vảy hậu môn. Vảy lưng có mép sau bằng, vảy bụng có mép sau hơi tròn. 2 vảy trước lỗ huyệt lớn. Vảy dưới đuôi rộng, cách lỗ huyệt một hàng vảy. Chi ngắn; có 5 bản mỏng dưới ngón I, 15 bản mỏng dưới ngón IV chi trước; 7 bản mỏng dưới ngón I, 20 bản mỏng dưới ngón IV chi sau. Thân xanh đen, mép mõm trắng đục. Cằm và họng trắng hồng. Bụng xám đen. Dưới đuôi và các chi trắng đục. Có 2 sọc trắng từ mõm qua trên mắt, kéo dài đến đuôi và 2 sọc bên thân. Đuôi có màu xanh ngọc, nhạt ở phía trước và sẫm hơn ở phía sau. Kiếm ăn ban đêm, dưới các thàm mục thực vật, quanh các khu vực có gốc cây to hay tảng đá mẹ trong rừng thường xanh. Thức ăn là các loài ấu trùng sống trong khu vực sinh sống.', NULL, 'Cao Bằng, Lạng Sơn, Thái Nguyên, Hoà Bình, Quảng Ninh, Sơn La, Thanh Hoá, Nghệ An, Hà Tĩnh, Quảng Bình, Thừa Thiên-Huế, Đà Nẵng, Quảng Nam, Đắk Lắk.\n\n  ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4869, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Eutropis', NULL, 'GEN_0707', 'eutropischapaensis', 'Eutropis chapaensis', '(Bourret, 1937)            ', 'Thằn lằn bóng sa pa', 'SPA_04923', 'Thằn lằn bóng (thông thường nhân dân gọi là thần lằn) có hình dạng giống cá cóc nhưng thân vững chắc, cổ rõ ràng, đuôi hình trụ thon dài. Chi dài và khỏe, đầu gối của chi sau không hướng sang bên như cá cóc mà hướng về phía trước. Chi trước và chi sau đều có 5 ngón, vỏ da thằn lằn có vảy sừng, đầu có nhiều tấm vảy lớn đối xứng ghép sát nhau và thân có vảy nhỏ tròn xếp lên nhau như vảy cá. Ngón có vuốt phát triển. Tuyến da chính thức thiếu làm da thằn lằn rất khô. Nhờ màng phôi đặc biệt, thằn lằn sinh sống hoàn toàn ở cạn.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4870, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Eutropis', NULL, 'GEN_0707', 'eutropislongicaudata', 'Eutropis longicaudata', '(Hallowell, 1856)            ', 'Thằn lằn bóng đuôi dài', 'SPA_04924', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4871, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Eutropis', NULL, 'GEN_0707', 'eutropismacularia', 'Eutropis macularia', '(Blyth, 1853)', 'Thằn lằn bóng đốm', 'SPA_04925', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4872, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Eutropis', NULL, 'GEN_0707', 'eutropismultifasciata', 'Eutropis multifaciasta', '(Kuhl, 1820)', 'Thằn lằn bóng hoa', 'SPA_04926', 'Loài thằn lằn có kích thước trung bình, dài thân 66 - 122mm, dài đuôi 124 - 195mm. Đầu phủ vảy tấm đối xứng, không phân biệt với cổ. Mõm tù, tấm mõm rộng hơn cao. Lỗ mũi tròn, nằm giữa tấm mũi, hai vảy trên mũi cách nhau bởi vảy trán - mũi và vảy trán. Có 1 cặp tấm gáy tiếp xúc với nhau, đôi khi bị ngăn cách bởi một vảy nhỏ. Có 2 vảy má và 4 vảy trên ổ mắt, 6 - 7 vảy trên mí mắt. Mép trên có 6 - 7 vảy và 6 - 8 vảy mép dưới ở mỗi bên. Vảy thái dương gồm 3 hàng. Tấm cằm rộng hơn cao, một vảy sau cằm lẻ, rộng hơn dài. 2 cặp vảy sau cằm, cặp thứ nhất tiếp xúc với nhau, cặp thứ hai thường cách nhau bởi một vảy nhỏ. Màng nhĩ sâu, chiều cao hơn chiều dài.\n\nVảy thân tương đối đồng đều, xếp theo kiểu ngói lợp từ trước đến sau. Vảy trên lưng có 3 gờ rõ (đôi khi có 5 gờ) vảy bên hông có gờ mảnh hơn, vảy bụng nhẵn. Có 30 - 33 hàng vảy bao quanh giữa thân kể cả vảy bụng. 39 - 46 hàng vảy dọc theo lưng, 46 - 54 hàng vảy dọc theo bụng, 68 - 94 hàng vảy dưới, giữa đuôi. Vảy ở các chi nhỏ hơn vảy ở thân. Vảy chi trước nhẳn, vảy chi sau mặt trên có gờ mảnh, mặt dưới không có gờ.\n\nThân màu nâu bóng hoặc nâu đen bóng, mặt bụng và phía dưới các chi sáng màu hơn trên lưng. Trên lưng có từ 5 - 7 dải nhỏ màu nâu sẫm, (rộng bằng 1/3 chiều rộng của 1 hàng vảy) chạy dọc từ tấm sau gáy đến tận gốc đuôi. Hai bên sườn cũng có màu nâu sẫm. Con cái có các đốm trắng nằm dọc hai bên thân từ sau lỗ tai đến 1/3 chiều dài đuôi. Loài bò sát máu lạnh này khá phổ biến gần các nơi con người sinh sống, bờ sông và các con suối rộng nơi đất thấp và có độ cao tương đối. Chúng thường điều tiết thân nhiệt dưới ánh nắng ban ngày, sưởi ấm và tìm thức ăn ở các nơi bỏ hoang, hoặc trên các tảng đá, thân cây, hàng rào và các bức tường có bề mặt thô ráp. Thức ăn là các loài động vật không xương sống. Con cái đẻ 5 - 10 trứng.', NULL, 'Hầu hết ở các tỉnh nước ta từ Lai Châu (Bình Lư), cho đến Minh Hải, Kiên Giang, Cà Mau  Loài này sống ở nhiều nơi từ phía Đông Ấn Độ tới Hải Nam và New Ghine.\n\n ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4873, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Lipinia', NULL, 'GEN_1090', 'lipiniavittigera', 'Lipinia vitigera', '(Boulenger, 1894)', 'Thằn lằn vạch đỏ', 'SPA_04927', 'Loài thằn lằn có kích thước nhỏ, dài đuôi 4,5cm,chiều dài thân 10cm. Thân có những sọc màu kem và màu đen trơn từ đỉnh đầu đến huyệt. Một sọc màu trắng ở giữa lưng kéo dài từ mut mõm đến hơn nửa thân và chuyển dần sang màu vàng cam. Hai bên là hai sọc màu đen chạy dọc theo phần lưng. Đuôi màu cam lửa với những đốm màu đen không đồng nhất nằm hai bên đến gần mút đuôi. Sống hoàn toàn trên cây, rất ít khi xuống mặt đất, chúng leo treo giỏi, di chuyển dễ dàng trên các thân cây, các trụ tường và các khúc gỗ to. Thỉnh thoảng thấy chúng xuất hiện ở những nơi đất thấp và những nơi có độ cao thấp không quá 800m. Hoạt động kiếm ăn ban ngày ờ gần rừng cây cao, suối và các nơi ẩm ướt. Thức ăn của chúng là các loài côn trùng nhỏ. Con cái đẻ 2 - 4 trứng rất to. Thằn lằn con nở trong các đợt mưa có gió mùa.', NULL, 'Việt Nam: Thừa Thiên Huế, Quảng Nam - Đà Nẵng (Phúc Sơn), Gia Lai (Sơklang, Chư Sê), Kontum, Lâm Đồng (Langbiang, Đá Bàn), Đồng Nai Thế giới: phân bố rộng khắp trên hầu hết lục địa Đông Nam châu Á, từ Đông Ấn Độ, Thái Lan, Malaysia', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4874, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Lygosoma', NULL, 'GEN_1128', 'lygosomaalbopunctatum', 'Lygosoma albopunctatum', '(Gray, 1846)', 'Thằn lằn chân ngắn', 'SPA_04928', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4875, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Lygosoma', NULL, 'GEN_1128', 'lygosomaangeli', 'Lygosoma angeli', '(SMITH, 1937) ', 'Thằn lằn chân ngắn an-gel', 'SPA_04929', ' màu nâu ở đầu, sẫm dần về phía đuôi; thân dài 25-28cm. Chân rất ngắn, các ngón chân có kích thước tương tự ngoại trừ ngón I. 5 phiến dưới ngón IV. Hầu hết các loài thằn lằn đều có đuôi nhỏ hơn thân nhưng loài thằn lằn Lygosoma angeli này có chóp đuôi dày bằng kích thước cơ thể nên trông giống như một con rắn có chân. Giữa thân có 30 hàng vảy. Vảy lưng không lớn hơn các vảy khác. Có 110-115 vảy dọc theo xương sống từ vảy đỉnh đến rìa bên của chi sau. Mỗi vảy có đốm đen ở gốc. Vảy phần trên có màu sáng hơn phần dưới, các chấm đen cũng nhỏ hơn. Khoảng cách giữa nách và háng khoảng 3,5-4 lần khoảng cách từ mút mõm đến chi trước. Mí mắt dưới có vảy. Các cơ trên mũi tiếp xúc với nhau ở giữa. vảy trán dài hơn vảy trán đỉnh. Không có vảy da gáy. Quy mô thời gian không mở rộng. Mở tai giống như một chấm nhỏ. 7 vảy trên môi, vảy thứ tư hoặc thứ năm dưới mắt ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4876, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Lygosoma', NULL, 'GEN_1128', 'lygosomaboehmei', 'Lygosoma boehmei', 'Ziegler, Schmitz, Heidrich,', 'Thằn lằn chân ngắn bo me', 'SPA_04930', 'Kích thước nhỏ, chiều dài thân 66.8 - 78.3 mm. Chân ngắn có 5 ngón. Vảy môi trên 6 hoặc 7. Vảy môi dưới 5 hoặc 6. Vảy mi mắt trên 7. Vảy trên mắt 4. Màng da dưới ngón thứ III chân trước 5 hoặc 6. Màng da dưới ngón thứ IV chân sau 6 hoặc 7. Hàng vảy giữa thân 25 hoặc 26. Hàng vảy từ nách đến háng 99 - 101. Hàng vảy bên xương sống 117 - 121. Vảy trán chẩm đơn nở rộng hoà vào nhau. Có 2 tấm trên mũi tiếp xúc với nhau, tấm trán mũi lớn, nguyên, hai tấm trước bé, tách nhau bời đường nối giữa tấm trán và tấm trán mũi. Lỗ mũi ở viền sau tấm mũi, tiếp xúc với tấm sau mũi. Mí mắt dưới bị các vẩy nhỏ che phủ. có khoảng 26 - 28 hàng vảy bao quanh thân, nhăn, bóng, ánh kim dưới ánh nắng mặt trời. 58 vảy dọc lưng từ sau tấm gáy đến phần trước gốc đùi.', NULL, 'Trong nước: Loài thằn lằn chân ngắn này sinh sống hầu khắp các khu vực ở Việt Nam cho đến 1.000m thuộc Vườn quốc gia Tam Đảo', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5671'),
(4877, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Lygosoma', NULL, 'GEN_1128', 'lygosomabowringii', 'Lygosoma bowringii', '(Linnaeus, 1766)', 'Thằn lằn chân ngắn bao-ring', 'SPA_04931', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4878, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Lygosoma', NULL, 'GEN_1128', 'lygosomacorpulentum', 'Lygosoma corpulentum', '(Smith, 1921)', 'Thằn lằn chân ngắn bao', 'SPA_04932', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4879, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Lygosoma', NULL, 'GEN_1128', 'lygosomaquadrupes', 'Lygosoma quadruped', '(Günther, 1864)', 'Thằn lằn chân ngắn', 'SPA_04933', 'Loài thằn lằn có kích thước nhỏ, chiều dài thân 15cm, dài đuôi gấp 1,5 lần chiều dài thân. Các chi thu nhỏ lại rất nhiều, nhưng vẫn có năm ngón. Đôi chân rất mảnh vì hầu như nó không đủ mạnh để nâng đỡ cơ thể chúng. Thân có nhiều sọc mảnh bóng, kéo dai từ đỉnh đầu đến gần chót đuôi. Chân có vảy nhỏ và có móng nhọn. Có 2 tấm trên mũi tiếp xúc với nhau, tấm trán mũi lớn, nguyên, hai tấm trước bé, tách nhau bời đường nối giữa tấm trán và tấm trán mũi. Lỗ mũi ở viền sau tấm mũi, tiếp xúc với tấm sau mũi. Mí mắt dưới bị các vẩy nhỏ che phủ. có khoảng 26 - 28 hàng vảy bao quanh thân, nhăn, bóng, ánh kim dưới ánh nắng mặt trời. 58 vảy dọc lưng từ sau tấm gáy đến phần trước gốc đùi. Là loài tiêu biểu nhất cho lối sống trong hang trong số các loài thằn lằn thuộc giống Lygosoma. Thường được tìm thấy chui rúc và kiếm ăn trong lớp thảm mục thực vật trong rừng và thỉnh thoảng gặp chúng ở các khúc gỗ mục, khu vực dân cư hay đất nông nghiệp. Thức ăn của chúng gồm mối và ấu trùng. Chúng hoạt động ban ngày. Mỗi lần sinh sản từ  2 hoặc 3 trứng, trứng nở sau năm tuần.', NULL, 'Việt Nam: Loài thằn lằn chân ngắn này sinh sống hầu khắp các khu vực ở Việt Nam cho đến 1.000m thuộc Vườn quốc gia Tam Đảo Thế giới: Loài thằn lằn nhỏ kỳ lạ này sống nhiều nơi trong khu vực của Đông nam Á.Thái Lan, Campuchia, Lào, miền nam Trung Quốc, Hồng Kông, Tây Malaysia, Indonesia (các đảo Sumatra, Java, Salayar), Philippine (các đảo Calamian thuộc Palawan).', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4880, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Mabuya', NULL, 'GEN_1131', 'mabuyachapaensis', 'Mabuya chapaensis', '(Bourret, 1937)', 'Thằn lằn bóng Sapa', 'SPA_04934', 'Thằn lằn bóng (thông thường nhân dân gọi là thần lằn) có hình dạng giống cá cóc nhưng thân vững chắc, cổ rõ ràng, đuôi hình trụ thon dài. Chi dài và khỏe, đầu gối của chi sau không hướng sang bên như cá cóc mà hướng về phía trước. Chi trước và chi sau đều có 5 ngón, vỏ da thằn lằn có vảy sừng, đầu có nhiều tấm vảy lớn đối xứng ghép sát nhau và thân có vảy nhỏ tròn xếp lên nhau như vảy cá. Ngón có vuốt phát triển. Tuyến da chính thức thiếu làm da thằn lằn rất khô. Nhờ màng phôi đặc biệt, thằn lằn sinh sống hoàn toàn ở cạn. ', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Hệ thống thông tin, cơ sở dữ liệu môi trường tỉnh Bắc Kạn'),
(4881, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Mabuya', NULL, 'GEN_1131', 'mabuyalongicaudata', 'Mabuya longicaudata', '(Hallowell, 1857)', 'Thằn lằn bóng đuôi dài', 'SPA_04935', 'Thân màu rám nắng hoặc nâu đỏ; có sọc nâu sẫm ở mỗi bên, kéo dài từ mắt đến chân sau. Cả cá con và cá trưởng thành đều có thể có đốm đen mờ hoặc sọc ở lưng. Mặt dưới màu vàng lục hoặc vàng. Đầu khá dài. Môi màu vàng với vạch đen. Hai bên sườn dưới màu trắng, nhuốm màu xanh lục, có lốm đốm dày màu nâu. Chân màu nâu. Đuôi rất dài và giống như chiếc roi; có vảy sống. Các vảy giữa lưng bị cong.', NULL, 'Khá phổ biến ở Hồng Kông và khá phổ biến ở một số khu vực của Tân Giới. Ngoài ra còn có mặt ở một số đảo nhỏ (Cheung Chau). Sokos được biết đến từ một số đảo nhỏ. Kéo dài từ cực nam Trung Quốc bao gồm Đài Loan, đến Đông Nam Á.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.biosch.hku.hk/ecology/hkreptiles/lizard/Eutropis_longicaudata.html'),
(4882, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Mabuya', NULL, 'GEN_1131', 'mabuyamacularia', 'Mabuya macularia', '(Blyth, 1853)            ', 'Thằn lằn bóng đốm', 'SPA_04936', 'Bốn đường kẻ sọc đốm đen trên lưng. Mặt lưng có màu nâu, có nhiều đốm đen. Trên môi có sọc trắng trải dài ra sau đến vai. Có một đường kẻ sáng màu dọc bên thân trải dài từ mắt đến nửa thân. Sườn thân màu nâu sậm từ sau mắt đến chân sau cùng với những đốm trắng. Cổ và họng hơi đỏ ở con đực và có màu kem ở con cái. Bụng và mặt dưới đuôi có màu kem. Con đực có chiều dài mút mõm đến lỗ huyệt 55.6 - 61.7 mm. Con cái có chiều dài mút mõm đến lỗ huyệt 55.4 - 59.6 mm. Vảy trên cằm và họng với đường viền màu nâu.', NULL, 'Trong nước: Có hầu khắp các tỉnh từ Bắc đến Nam, loài này có vùng phân bố rộng khắp cả nước.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=6218'),
(4883, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Mabuya', NULL, 'GEN_1131', 'mabuyamultifasciata', 'Mabuya multifasciata', '(Kuhl, 1820)            ', 'Thằn lằn bóng hoa', 'SPA_04937', 'Loài thằn lằn có kích thước trung bình, dài thân 66 - 122mm, dài đuôi 124 - 195mm. Đầu phủ vảy tấm đối xứng, không phân biệt với cổ. Mõm tù, tấm mõm rộng hơn cao. Lỗ mũi tròn, nằm giữa tấm mũi, hai vảy trên mũi cách nhau bởi vảy trán - mũi và vảy trán. Có 1 cặp tấm gáy tiếp xúc với nhau, đôi khi bị ngăn cách bởi một vảy nhỏ. Có 2 vảy má và 4 vảy trên ổ mắt, 6 - 7 vảy trên mí mắt. Mép trên có 6 - 7 vảy và 6 - 8 vảy mép dưới ở mỗi bên. Vảy thái dương gồm 3 hàng. Tấm cằm rộng hơn cao, một vảy sau cằm lẻ, rộng hơn dài. 2 cặp vảy sau cằm, cặp thứ nhất tiếp xúc với nhau, cặp thứ hai thường cách nhau bởi một vảy nhỏ. Màng nhĩ sâu, chiều cao hơn chiều dài. Vảy thân tương đối đồng đều, xếp theo kiểu ngói lợp từ trước đến sau. Vảy trên lưng có 3 gờ rõ (đôi khi có 5 gờ) vảy bên hông có gờ mảnh hơn, vảy bụng nhẵn. Có 30 - 33 hàng vảy bao quanh giữa thân kể cả vảy bụng. 39 - 46 hàng vảy dọc theo lưng, 46 - 54 hàng vảy dọc theo bụng, 68 - 94 hàng vảy dưới, giữa đuôi. Vảy ở các chi nhỏ hơn vảy ở thân. Vảy chi trước nhẳn, vảy chi sau mặt trên có gờ mảnh, mặt dưới không có gờ. Thân màu nâu bóng hoặc nâu đen bóng, mặt bụng và phía dưới các chi sáng màu hơn trên lưng. Trên lưng có từ 5 - 7 dải nhỏ màu nâu sẫm, (rộng bằng 1/3 chiều rộng của 1 hàng vảy) chạy dọc từ tấm sau gáy đến tận gốc đuôi. Hai bên sườn cũng có màu nâu sẫm. Con cái có các đốm trắng nằm dọc hai bên thân từ sau lỗ tai đến 1/3 chiều dài đuôi. Loài bò sát máu lạnh này khá phổ biến gần các nơi con người sinh sống, bờ sông và các con suối rộng nơi đất thấp và có độ cao tương đối. Chúng thường điều tiết thân nhiệt dưới ánh nắng ban ngày, sưởi ấm và tìm thức ăn ở các nơi bỏ hoang, hoặc trên các tảng đá, thân cây, hàng rào và các bức tường có bề mặt thô ráp. Thức ăn là các loài động vật không xương sống. Con cái đẻ 5 - 10 trứng.', NULL, 'Việt Nam: Hầu hết ở các tỉnh nước ta từ Lai Châu (Bình Lư), cho đến Minh Hải, Kiên Giang, Cà Mau Thế giới: Loài này sống ở nhiều nơi từ phía Đông Ấn Độ tới Hải Nam và New Ghine.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4884, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Mabuya', NULL, 'GEN_1131', 'mabuyasp', 'Mabuya sp.', NULL, '', 'SPA_04938', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4885, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Plestiodon', NULL, 'GEN_1588', 'plestiodonchinensis', 'Plestiodon chinensis', '(GRAY, 1839)', 'Thằn lằn tốt mã tr. quốc', 'SPA_04939', 'Thân khỏe và to, màu xanh ô liu hoặc nâu ô liu, thường có các đốm đỏ ở hai bên sườn.\nMặt dưới màu kem hoặc màu vàng nhạt. Đầu có hình tam giác mạnh; rất rộng ở con đực trưởng thành.\nCon non trải qua sự thay đổi về màu sắc cơ thể khi chúng lớn lên ở dạng trưởng thành.\nThằn lằn non có màu đen hoặc nâu sô cô la, có ba sọc lưng màu sáng, đuôi màu xanh và các đốm trắng ở hai bên sườn tạo thành một sọc bên đứt quãng.\nNhững con lớn hơn có lưng màu ô liu với ba sọc lưng nhạt. Vảy mịn và bóng, không có gai. Chủ yếu được tìm thấy ở vùng đất thấp; Hiếm khi ở đồng cỏ đồi núi.\nThường thấy chúng rình mò ở những vùng cỏ hoặc bụi rậm, đồng ruộng và rìa đầm lầy ngập mặn. Cũng được tìm thấy ẩn dưới những tảng đá và những tấm ván cũ. Trong điều kiện nuôi nhốt, chúng ăn côn trùng lớn bao gồm dế, châu chấu và gián; giun đất, ốc sên và thằn lằn nhỏ như Thằn lằn cỏ. Đẻ trứng, có thể đẻ trứng vào cuối mùa xuân. Kích thước ly hợp 5 -7. Nằm dưới tảng đá hoặc giữa các kẽ hở của rễ cây. Con non có chiều dài khoảng 4 cm khi mới nở.', NULL, ' miền Nam Trung Quốc', NULL, NULL, NULL, NULL, NULL, NULL, 'Reptile of Hong Kong'),
(4886, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Plestiodon', NULL, 'GEN_1588', 'plestiodonelegans', 'Plestiodon elegans', '(Boulenger, 1887)', 'Thằn lằn tốt mã thượng hải', 'SPA_04940', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4887, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Plestiodon', NULL, 'GEN_1588', 'plestiodonquadrilineatus', 'Plestiodon quadrilineatus', 'Blyth, 1853            ', 'Thằn lằn tốt mã chỉ', 'SPA_04941', 'Tấm mõm rộng bằng hai lần cao; 2 tấm trên mũi chạm nhau và chạm tấm sau mũi. Lỗ mũi ở giữa tấm mũi. Có 1 tấm sau mũi; 2 tấm má nằm trên tấm mép trên thứ nhất và thứ hai. Tấm trán - mũi nguyên, phía bên tiếp xúc với tấm má thứ nhất. Có 2 tấm trước trán, đường nối giữa chúng bé hơn chiều dài tấm trán mũi, phía bên tiếp xúc với cả 2 tấm má. Tấm trán dài hơn 2 lần rộng, dài hơn khoảng cách từ nó đến tấm mõm; phía bên tiếp xúc với tấm trên ổ mắt thứ nhất, thứ hai và một phần tấm thứ ba. Có 2 tấm trán đỉnh rộng hơn tấm gian đỉnh, tương đương tấm trước trán; tấm trán đỉnh tiếp xúc với tấm trên ổ mắt thứ ba và thứ tư ở phía bên, phía sau tiếp xúc tấm gian đỉnh và tấm đỉnh.\n\nTấm gian đỉnh nằm giữa 2 tấm đỉnh và 2 tấm trán đỉnh. Tấm đỉnh lớn, gấp 2 lần tấm gian đỉnh. Có 3 cặp tấm gáy dài. Có 2 tấm trước dưới ổ mắt; 6 tấm trên mi; 4 tấm trên ổ mắt; 1 tấm sau trên ổ mắt; 1 tấm sau mắt và 3 tấm sau dưới ổ mắt. Có 7 tấm mép trên, tấm thứ 7 lớn nhất, tấm thứ 5 tiếp xúc ổ mắt; 6 - 7 tấm mép dưới ở mỗi bên. Tấm cằm rộng gấp 2 lần dài, viền tấm cằm lớn hơn tấm mõm. Có 2 tấm sau cằm lẻ, tấm sau lớn hơn tấm trước một chút.\n\nVảy thân nhẵn. Có 22 hàng vảy bao quanh thân; 45 - 46 vảy dọc lưng từ sau tấm gáy đến ngang với trước gốc đùi; 57 vảy dọc bụng từ sau tấm cằm lẻ đến trước vảy hậu môn. Vảy lưng có mép sau bằng, vảy bụng có mép sau hơi tròn. 2 vảy trước lỗ huyệt lớn. Vảy dưới đuôi rộng, cách lỗ huyệt một hàng vảy. Chi ngắn; có 5 bản mỏng dưới ngón I, 15 bản mỏng dưới ngón IV chi trước; 7 bản mỏng dưới ngón I, 20 bản mỏng dưới ngón IV chi sau. Thân xanh đen, mép mõm trắng đục. Cằm và họng trắng hồng. Bụng xám đen. Dưới đuôi và các chi trắng đục. Có 2 sọc trắng từ mõm qua trên mắt, kéo dài đến đuôi và 2 sọc bên thân. Đuôi có màu xanh ngọc, nhạt ở phía trước và sẫm hơn ở phía sau. Kiếm ăn ban đêm, dưới các thàm mục thực vật, quanh các khu vực có gốc cây to hay tảng đá mẹ trong rừng thường xanh. Thức ăn là các loài ấu trùng sống trong khu vực sinh sống.', NULL, 'Cao Bằng, Lạng Sơn, Thái Nguyên, Hoà Bình, Quảng Ninh, Sơn La, Thanh Hoá, Nghệ An, Hà Tĩnh, Quảng Bình, Thừa Thiên-Huế, Đà Nẵng, Quảng Nam, Đắk Lắk. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vncreatures'),
(4888, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Plestiodon', NULL, 'GEN_1588', 'plestiodontamdaoensis', 'Plestiodon tamdaoensis', '(Bourret, 1937)            ', 'Thằn lằn tốt mã tam đảo', 'SPA_04942', 'Mặt lưng có màu đen hoặc nâu đồng. Trên đầu có màu nâu hơn. Cơ thể có năm sọc trắng vàng - ba sọc lưng và hai sọc bên. Với 5 sọc trên lưng, Đuôi có màu xanh lam, nhưng có thể nhạt dần theo tuổi tác. ăn ôn trùng nhỏ và động vật không xương sống.', NULL, ' ', NULL, NULL, NULL, NULL, NULL, NULL, 'Reptile of Hong Kong'),
(4889, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Riopa', NULL, 'GEN_1754', 'riopabowringii', 'Riopa bowringii', '(Gunther, 1864)', 'Thằn lằn Riô Baorin', 'SPA_04943', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4890, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Saiphos', NULL, 'GEN_1767', 'saiphostridigitum', 'Saiphos tridigitum', 'Bourret.', 'Thằn lằn Saipho ba ngón', 'SPA_04944', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4891, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Scincella', NULL, 'GEN_1792', 'scincelladoriae', 'Scincella doriae', '(Boulenger, 1887)', 'Thằn lằn cổ do ri a', 'SPA_04945', 'Một loài thằn lằn lớn, có chiều dài từ mút mõm đến lỗ huyệt là 56 mm, chân khoẻ. Vảy trước trán ít tách biệt hoặc chỉ chạm vào nhau. Hơn 10 cái lông mi và 4 đến 5 cặp vảy gáy phình ra. Mặt bên sậm màu, có lấm tấm đốm trắng. Có 6 - 7 vảy trên mi mắt, thường có 11 lông mi. Vảy sau phía trên mắt rộng. Vảy thứ năm và thứ sau của môi trên ngay dưới mắt. Tai tròn và khá rộng (đường kính 1.2 mm với cá thể trưởng thành), không có dái tai lồi ra, màng nhĩ khuất sâu. Có 3 - 5 cặp vảy gáy phình ra. Có 66 - 76 hàng vảy giữa thuỳ chẩm và đùi, 70 - 79 hàng vãy giữa cổ họng và bụng. 30 - 32 vảy quanh thân giữa. Vảy lưng rộng gấp 1.5 lần vảy bên thân. 10 - 15 màng vảy mỏng dưới ngón chân thứ tư và 15 - 18 màng vảy mỏng ở ngón cáy thứ tư. 10 - 15 vảy mỏng dưới ngón thứ tư và 15 - 18 vảy mỏng dưới ngón cái thứ tư. Lưng màu nâu đậm, có nhiều nốt nâu nhỏ, không hình thành vằn sườn. Mặt bên có vằn nâu sậm bắt đầu từ sau lỗ mũi kéo dài qua mắt và trên tài đến chân sau. Không có đốm trắng. Hông và mặt dưới chân có rất nhiều các nốt nâu sậm. Rìa môi trên và môi dưới có màu nâu. Mặt bụng và đuôi màu trắng vàng.', NULL, 'Tong nước: Loài hiếm gặp và mới chỉ gặp ở Vườn quốc gia Bidoup - Núi Bà, Chư Yang Sin, Khu bảo tồn thiên nhiên Hòn Bà. Loài này được đặt theo tên của Marchese Giacomo Doria (1840 - 1913), nhà động vật học người Ý đã thu thập mẫu vật thằn lằn và nghiên cứu ở Ba Tư (Iran) với de Filippi (1862 - 1863) và ở Borneo với Beccari (1865-1866). Ông thành lập Museo Civico di Storia Naturale, Turin (1867 - 1913) và làm Giám đốc đầu tiên của tổ chức này.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5997'),
(4892, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Scincella', NULL, 'GEN_1792', 'scincellamonticola', 'Scincella monticola', '(Schmidt, 1925)', 'Thằn lằn cổ núi', 'SPA_04946', ' Phần lưng và gốc đuôi màu nâu đồng với một số đốm đen không rõ ràng ở phần trước; vùng bên trên có sọc sẫm màu rõ rệt từ sau mắt đến chi sau; môi dưới có đốm đen; phần bụng và mặt dưới của kem nền đuôi', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.researchgate.net/figure/Scincella-monticola-VNMN-795-from-Pia-Oac-forest-Nguyen-Binh-District-Cao-Bang_fig1_292841757'),
(4893, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Scincella', NULL, 'GEN_1792', 'scincellaochracea', 'Scincella ochracea', '(Bourret, 1937)', 'Thằn lằn cổ thân đỏ', 'SPA_04947', 'Con đực có chiều dài thân 34.2 - 45.4 mm, dài đuôi 61.8 - 75.0 mm. Con cái, dài thân 43.2 - 50.0 mm, dài đuôi 63.9 mm. Đầu dài hơn rộng. Vảy mõm rộng hơn cao. Không có vảy trên mũi. Các vảy trước trán nối với nhau. Các vảy chẩm nối với nhau phía sau. Vảy gáy nở rộng 0 - 3 cặp. Vảy má 2. Vảy mi mắt trên 7 hoặc 8. Vảy trên mắt 4, theo sau bởi hai vảy nhỏ. Vảy thái dương thứ nhất 2. Vảy thái dương thứ hai 2, vảy trên lớn và được gối bởi vảy dưới. Vảy môi trên 7 (hiếm khi trong đó vảy thứ năm và sáu ngay dưới mắt. Viền tai có 3 hoặc 4 thùy lồi. Màng nhĩ chìm sâu. Vảy cằm rộng hơn dài. Vảy môi dưới 6( hiếm khi 5). Vảy sau cằm không chia đôi. Vảy giữa thân 30 - 32 hàng. Vảy lưng giữa các sọc bên xếp thành 1⁄2 + 6 + 1⁄2 hàng mịn. Vảy ven xương sống 61 - 67. Vảy bụng 66 - 71 hàng ngang mịn. Vảy trước huyệt 2, nở rộng. Vảy dưới đuôi nở rộng ở giữa. Chân ngắn, năm ngón. Ngón chân trước và chân sau tách xa nhau khi gập thân. Màng da dưới ngón thứ tư chân trước 9 - 11 , dưới ngón thứ tư chân sau 15 - 17 Màu trong cồn: Lưng màu xám bạc, có sọc xương sống đậm. Vùng mặt bên phía trên có vằn đỏ rõ từ sau mắt đến chân sau, có đốm sáng màu. Mép dưới vỡ ra thành những đốm đen nhỏ. Mặt bụng của thân và đuôi màu kem hoặc trắng.', NULL, 'Trong nước: Sơn La, Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=6337'),
(4894, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Scincella', NULL, 'GEN_1792', 'scincellareevesii', 'Scincella reevesii', 'Nguyen et al., 2020', 'Thằn lằn cổ rivơ', 'SPA_04948', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4895, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Scincella', NULL, 'GEN_1792', 'scincellarufocaudata', 'Scincella rufocaudata', 'Darevsky & Nguyen, 1983', 'Thằn lằn đuôi đỏ', 'SPA_04949', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4896, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Scincella', NULL, 'GEN_1792', 'scincellasp', 'Scincella sp', NULL, '  ', 'SPA_04950', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4897, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Scincella', NULL, 'GEN_1792', 'scincellavittigerum', 'Scincella vittigerum ', 'Smith, 1922', 'Thằn lằn vạch', 'SPA_04951', 'Loài thằn lằn có kích thước nhỏ, dài đuôi 4,5cm,chiều dài thân 10cm. Thân có những sọc màu kem và màu đen trơn từ đỉnh đầu đến huyệt. Một sọc màu trắng ở giữa lưng kéo dài từ mut mõm đến hơn nửa thân và chuyển dần sang màu vàng cam. Hai bên là hai sọc màu đen chạy dọc theo phần lưng. Đuôi màu cam lửa với những đốm màu đen không đồng nhất nằm hai bên đến gần mút đuôi. Sống hoàn toàn trên cây, rất ít khi xuống mặt đất, chúng leo treo giỏi, di chuyển dễ dàng trên các thân cây, các trụ tường và các khúc gỗ to. Thỉnh thoảng thấy chúng xuất hiện ở những nơi đất thấp và những nơi có độ cao thấp không quá 800m. Hoạt động kiếm ăn ban ngày ờ gần rừng cây cao, suối và các nơi ẩm ướt. Thức ăn của chúng là các loài côn trùng nhỏ. Con cái đẻ 2 - 4 trứng rất to. Thằn lằn con nở trong các đợt mưa có gió mùa.', NULL, 'Thừa Thiên Huế, Quảng Nam - Đà Nẵng (Phúc Sơn), Gia Lai (Sơklang, Chư Sê), Kontum, Lâm Đồng (Langbiang, Đá Bàn), Đồng Nai phân bố rộng khắp trên hầu hết lục địa Đông Nam châu Á, từ Đông Ấn Độ, Thái Lan, Malaysia', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(4898, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Sphenomorphus', NULL, 'GEN_1842', 'sphenomorphusbuenloicus', 'Sphenomorphus buenloicus', 'Darevsky et. Nguyen, 1983.', 'Thằn lằn phê-nô buôn lưới', 'SPA_04952', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4899, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Sphenomorphus', NULL, 'GEN_1842', 'sphenomorphuscryptotis', 'Sphenomorphus cryptotis', 'Darevsky, Orlov& Ho, 2004', 'Thằn lằn phê-nô tai lõm', 'SPA_04953', 'có kích thước trung bình, không có lỗ tai ngoài và hơi lõm tai; không có tiểu thùy tai; 6 ống nhòm; 10 – 12 siêu đường mật; 7 siêu môi; 36 – 39 hàng vảy; nuchals hiện diện; 16 – 21 phiến mỏng bên dưới ngón chân thứ tư; tay chân vừa phải (không hoặc chỉ chồng lên nhau khi ấn vào); một cặp lỗ hậu môn mở rộng; đuôi dài, dẹt sang một bên. ', NULL, 'Bắc Việt Nam (Tỉnh Quảng Ninh, huyện Quý Chang, tỉnh Nghệ An; Sơn La, Thanh Hóa), ​​Trung Quốc (Quảng Tây)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://reptile-database.reptarium.cz/species?genus=Sphenomorphus&species=cryptotis'),
(4900, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Sphenomorphus', NULL, 'GEN_1842', 'sphenomorphusdevorator', 'Sphenomorphus devorator', 'Darevsky, Orlov and Ho, 2004', 'Thằn lằn phê-nô yên tử', 'SPA_04954', 'Một con thằn lằn mảnh khảnh có kích thước trung bình, không có thùy tai và màng nhĩ bị lõm sâu; bốn ống nhòm; 8 siêu đường mật; 7 siêu môi; nuchals hiện diện; thân tròn 30 vảy; vảy của hai hàng đốt sống trên cổ rộng hơn nhiều rồi dài; 19 phiến mỏng bên dưới ngón chân thứ tư; các chi ngắn ', NULL, 'Bắc Việt Nam (Tỉnh Quảng Ninh, Sơn La)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://reptile-database.reptarium.cz/species?genus=Scincella&species=devorator'),
(4901, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Sphenomorphus', NULL, 'GEN_1842', 'sphenomorphusindicus', 'Sphenomorphus indicus', '(Gray, 1853)            ', 'Thằn lằn phê nô ấn độ', 'SPA_04955', 'Đặc điểm nhận dạng:\nKích thước lớn, chiều dài từ mút mõm đến lỗ huyệt của cá thể cái là 78.8 - 82.6 mm, ở cá thể đực là 63.4 - 69.6 mm. Đầu dài hơn rộng. Mõm rộng hơn cao. Vảy mũi trên tiêu biến. Vảy trước trán tách biệt với nhau bởi trán. Vảy chẩm chạm nhau về phía sau. Một cặp vảy phình ra. 2 vảy má. 4 vảy trên ổ mắt được tiếp nối bởi hai vảy trên sau ổ mắt. 2 vảy mang tai trên. 2 vảy tai dưới. Dưới mi mắt có vảy. Môi trên có 7 vảy, trong đó vảy thứ năm và thứ sáu dưới mắt, tách biệt với nó là một hàng vảy nhỏ. Xuất hiện tai ngoài với ba dái tai rất nhỏ. Màng nhĩ sâu bên trong. Cằm rộng hơn dài. Môi dưới có 7 vảy. Sau cằm không phân tách. Thân giữa có 34 - 36 hàng vảy. Vảy lưng giữa đường sọc thân ở ½ + 8 + ½ hàng, mượt và rộng như vảy bụng. Bên cột sống có 68 - 74 vảy. Bụng có 65 - 69 hàng vảy ngang, mượt. Hai vảy phình trước lỗ huyệt. Vảy giữa dưới đuôi không nới rộng. Chân ngắn, có 5 ngón. Các ngón chân và ngón cái chạm vào nhau khi chụm lại. Dưới ngón thứ 4 có 11 màng vảy mỏng và dưới ngón cái thứ tư có 15 - 18 màng vảy mỏng.\nMàu sắc mẫu vật: Lưng và đuôi có màu nâu vàng. Mặt bên phía trên có sọc xám sẫm, rộng bằng 3 hoặc 4 vảy, chạy từ sau mắt đến đáy đuôi. Sọc lưng bụng sáng xuất hiện trên cổ và vai. Mép dưới của sọc đậm màu có một bài nốt loang sáng. Vùng dưới bụng màu xám sáng. Vùng dưới mặt bên màu xám sáng. Bụng trắng.\nSinh học, sinh thái:\nLoài bò sát này sống trong các hang hốc và dưới các lớp thảm mục thực vật ở rừng thường xanh và cả các khu rừng phục hồi sau nương rẫy ở độ cao thấp đến 800m. Thức ăn là các loài côn trùng, chân đốt sống trong các khu vực phân bố, kiếm ăn ban ngày, khá nhút nhát. Đẻ 2 trứng trong hốc cây hoặc dưới lớp thảm mục thực vật.', NULL, 'Trong nước: Lào Cai, Lạng Sơn. Đồng Nai, Bình Phước\nNgoài nước: Ấn Độ, Trung Quốc và các nước Đông Nam Á khác như Cambodia, Lào, Malaysia, Thái Lan.', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4902, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Sphenomorphus', NULL, 'GEN_1842', 'sphenomorphusmaculatus', 'Sphenomorphus maculatus', '(Blyth, 1853)            ', 'Thằn lằn phê-nô đốm', 'SPA_04956', 'Đầu thon và phẳng. Đuôi thuôn nhọn và dài gấp đôi chiều dài mõm. Thân và mí mắt phủ vảy. Vảy ở lưng lớn dần về phía đuôi. Mặt trên của đầu, thân và đuôi có màu nâu, có vảy mịn và các mảng sẫm màu hơn. Cổ họng và bụng nhợt nhạt và không tì vết. Ở hai bên sườn, bên dưới sọc sẫm màu, có một vùng lốm đốm bao gồm các đốm màu vàng và nâu. về đêm; sống ở vùng lân cận các dòng suối và sông nhỏ ở vùng đất thấp và đồi núi. Được tìm thấy khi tìm kiếm thức ăn giữa các tảng đá và thảm thực vật ngay sát mép nước. Ăn côn trùng nhỏ và động vật không xương sống.  Hành vi tán tỉnh và giao phối được thực hiện theo nghi thức nghiêm ngặt và bắt đầu vào tháng 4-tháng 6. Cá con xuất hiện vào cuối tháng 8-tháng 9', NULL, ' Bangladesh, Bhutan, Campuchia, Trung Quốc (Nam Vân Nam, SE Xizang = Tây Tạng), Ấn Độ (Darjeeling, Quần đảo Andaman và Nicobar), Myanmar, Bắc Thái Lan, Nepal, New Guinea, khu vực Sunda (Brunei, Đông Timor, Indonesia, Malaysia, Singapore) và Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'thainationalparks'),
(4903, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Sphenomorphus', NULL, 'GEN_1842', 'sphenomorphusrufocaudatus', 'Sphenomorphus rufocaudatus', 'DAREVSKY & NGUYEN VAN SANG 1983. ', 'Thằn lằn phê nô đuôi đỏ ', 'SPA_04957', ' Kích thước nhỏ (SVL 35,8–48,8 mm); các phần trước trán tiếp xúc với nhau ở phía gần; siêu thị bốn; có hoặc không có một cặp nuchals; mí mắt dưới di động, có vảy; siêu âm bảy; thái dương sơ cấp hai; có tai ngoài, không có thùy, màng nhĩ hơi lõm xuống; vảy giữa thân xếp thành 32–34 hàng; vảy lưng nhẵn, vảy cạnh đốt sống 65–72, không rộng; tứ chi phát triển tốt, có năm ngón; vảy ở mặt lưng gốc ngón IV xếp thành ba hàng; 15–19 phiến nhẵn dưới ngón chân thứ tư; viền tự do của mí mắt trên và dưới viền trắng; lưng và gốc đuôi màu nâu đồng với một sọc đốt sống sẫm màu không liên tục; vùng bên trên có sọc đen, bị gián đoạn bởi các đốm sáng nhỏ từ phía sau cổ. ', NULL, ' nằm trong Vườn quốc gia Cát Bà, đảo Cát Bà, Hải Phòng,', NULL, NULL, NULL, NULL, NULL, NULL, 'https://reptile-database.reptarium.cz/species?genus=Sphenomorphus&species=tonkinensis'),
(4904, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Sphenomorphus', NULL, 'GEN_1842', 'sphenomorphussp', 'Sphenomorphus sp.', NULL, 'Thằn lằn phe -no sp', 'SPA_04958', 'Loài Sphenomorphus sheai được mô tả bởi tác giả Nguyễn Quãng Trường và các cộng sự dựa vào các mẫu vật thu được tại khu vực Cao nguyên Kom Tum, Việt Nam. Loài thằn lằn mới mô tả này có kích thước nhỏ hơn so với các loài khác trong cùng nhóm với chiều dài thân đầu là 35.2mm, chiều dài đuôi là 58.5mm. Phần lưng và gốc đuôi có màu nâu với các đốm đen rõ, phần cuối đuôi có màu nâu tối. Vùng trên đầu và hai bên hông có một vệt đen hẹp chạy dài từ sau mắt đến gốc đuôi. Vảy trên lưng mịn với hai mươi hàng vảy.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sie.vast.vn/posts/162-mo-ta-loai-than-lan-phe-no-moi-o-viet-nam.vi'),
(4905, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Sphenomorphus', NULL, 'GEN_1842', 'sphenomorphussp1', 'Sphenomorphus sp1', NULL, '  ', 'SPA_04959', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4906, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Sphenomorphus', NULL, 'GEN_1842', 'sphenomorphussp2', 'Sphenomorphus sp2', NULL, '  ', 'SPA_04960', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4907, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Sphenomorphus', NULL, 'GEN_1842', 'sphenomorphusstellatus', 'Sphenomorphus stellatus', 'Boulenger 1900            ', 'Thằng lằn phê nô shea', 'SPA_04961', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4908, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Sphenomorphus', NULL, 'GEN_1842', 'sphenomorphustriaeniatus', 'Sphenomorphus triaeniatus', '(BOURRET, 1937)', 'Thằn lằn phêno ba vạch', 'SPA_04962', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4909, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Sphenomorphus', NULL, 'GEN_1842', 'sphenomorphustridigitus', 'Sphenomorphus tridigitus', 'Bourret, 1939', 'Thằn lằn phê nô ba ngón', 'SPA_04963', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4910, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Tropidophorus', NULL, 'GEN_1998', 'tropidophorusbaviensis', 'Tropidophorus baviensis', 'Bourret, 1939', 'Thằn lằn tai ba vì', 'SPA_04964', 'Loài bò sát này co1 kích thước nhỏ trong giống Tropidophorus. Chiều dài mút mõm đến hậu môn khoảng 9,5 cm, chiều dài toàn bộ cơ thể là 16cm. Đầu nhọn hình tam giác. Thân mình mập, dẹt, vẩy sắc và xù xì có gờ dọc giữa vảy. Lưng màu bâu đen, với những vệt vàng sáng màu chạy ngang qua, đứt quãng. Bụng màu nhạt Loài này thường sống trong ácc khu rừng còn tốt dưới thảm mục nền rừng, trên núi đá và ven suối và đã ghi nhận ở độ cao trên 800m ở VQG Ba Vì. Thức ăn của loài này là các loài côn trùng nhỏ như kiến, mối.', NULL, 'Đây là loài có vùng phân bố Ninh Bình, Hà Nội (Ba Vì), Thanh Hoá, Hoà Bình. ', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4911, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Tropidophorus', NULL, 'GEN_1998', 'tropidophorusberdmorei', 'Tropidophorus berdmorei', 'Ziegler, Thanh & Thanh, 2005', 'Thằn lằn tai Bec mơ ', 'SPA_04965', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4912, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Tropidophorus', NULL, 'GEN_1998', 'tropidophoruscocincinensis', 'Tropidophorus cocincinensis', 'Duméril et Bibron, 1838', 'Thằn lằn tai vảy nhỏ', 'SPA_04966', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4913, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Tropidophorus', NULL, 'GEN_1998', 'tropidophoruscucphuongensis', 'Tropidophorus cucphuongensis', 'Smith, 1923', 'Thằn lằn tai Cúc Phương', 'SPA_04967', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4914, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Tropidophorus', NULL, 'GEN_1998', 'tropidophorushainanus', 'Tropidophorus hainanus', 'SMITH, 1923', 'Thằn lằn tai hải nam', 'SPA_04968', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4915, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Tropidophorus', NULL, 'GEN_1998', 'tropidophorusmicrolepis', 'Tropidophorus microlepis', 'Gunther, 1861', 'Thằn lằn tai vẩy nhỏ', 'SPA_04969', 'Đặc điểm để nhận ra loài bò sát máu lạnh này là Dài thân khoảng 70-80 mm, cơ thể hơi dẹp. Các vảy trên đầu và thân đều có gờ. Vảy thân xếp theo kiểu lợp ngói, thay đổi từ 28-32 hàng. Vảy bên sườn cũng có gờ, xếp chồng lên nhau, phía sau vuốt nhọn. Vảy bụng nhẵn, vảy dưới đuôi lớn hơn hẳn các vảy bên cạnh. Đầu và thân màu nâu, có một sọc mờ sẫm màu không chạy từ sau mắt về phía màng nhĩ, sườn màu nâu đôi khi có các vệt sáng màu kem hoặc màu cam. Loài này cư trú ở các con suối nhỏ trong rừng thường xanh có độ cao tương đối. Con cái đẻ mỗi lần 7- 9 con, thằn lằn con dài 56 - 60mm.', NULL, 'Sơn La (Mộc châu), Lâm Đồng (Langbiang, Lộc châu). Mã Đà, Cát Tiên (Đồng Nai) Loài Thằn lằn tai vẩy nhỏ phân bố ở Đông Nam Thái Lan, Cambodia', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures.net'),
(4916, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Tropidophorus', NULL, 'GEN_1998', 'tropidophorussinicus', 'Tropidophorus sinicus', '(Boettger, 1886)', 'Thằn lằn tai Trung Quốc', 'SPA_04970', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4917, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Scincidae', 'Thằn Lằn Bóng', 'FAM_333', 'Tropidophorus', NULL, 'GEN_1998', 'tropidophorussp', 'Tropidophorus sp', NULL, '  ', 'SPA_04971', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4918, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Typhlopidae', 'Rắn Giun', 'FAM_385', 'Indotyphlops', NULL, 'GEN_0963', 'indotyphlopsbraminus', 'Indotyphlops braminus', '(Daudin, 1803)', 'Rắn giun thường', 'SPA_04972', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4919, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Typhlopidae', 'Rắn Giun', 'FAM_385', 'Ramphotyphlops', NULL, 'GEN_1710', 'ramphotyphlopsbraminus', 'Ramphotyphlops braminus', '(Daudin, 1803)            ', 'Rắn giun thường', 'SPA_04973', 'Rắn giun thường là loài bò sát có chiều dài cơ thể tới 23 cm. Mõm tương đối hẹp, chiếm khoảng 20 - 33 % chiều rộng của đầu. Mắt của loài rắn có phân bố rộng này có thể nhận thấy được. Màu sắc rắn hầu như đồng nhất, ở thân trên có màu từ nâu đậm sang màu đen nhưng thân dưới thì nhạt màu hơn. Mõm, vùng hậu môn, đỉnh đuôi có màu nhạt. Thức ăn chủ yếu của rắn giun thường là trứng kiến và mối. Được ghi nhận là loài rắn sinh sản đơn tính. Mọi cá thể đều là giống cái hay giống đực vẫn chưa có dẫn liệu. Con cái đẻ từ 1 - 7 trứng, kích thước 2 x 6mm, không có sự thụ tinh. Tất cả trứng nở ra đều là giống cái. Rắn giun thường sống ở những nơi có độ cao từ mực nước biển đến 1.640m và chúng thường sống dưới mặt đất, dưới các đống đổ nát trên mặt đất, hoặc trong các cây mục quanh nhà hay trong rừng.', NULL, 'Việt Nam: Bắc Thái (Ký Phú, Lạng Sơn, Hà Nội (Nghĩa Đô, Hà Bắc (Thăng Long), Hải Phòng (Cát Bà, Thái Bình (Đồng Tiến) Hà Tĩnh (Hoà Hải), Quản Trị (Vĩnh Linh) Quảng Nam - Đà Nẵng (Cù lao Chàm), Gia Lai (Nông trường Sông Ba), Tây Ninh, thành phố HCM, Kiên Giang (Hà Tiên) Thế giới: loài rắn này được tìm thấy trên khắp Thái Lan, bán đảo Malaysia, và Singapore. Nó cũng được ghi nhận từ Châu Phi, vùng Trung Đông, các vùng còn lại của châu Á nhiệt đới và một số khu vực của châu Á có khí hậu ôn hòa, từ các đảo trên Thái Bình Dương và từ Mexico và Hoa Kỳ.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4920, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Typhlopidae', 'Rắn Giun', 'FAM_385', 'Typhlops', NULL, 'GEN_2008', 'typhlopsdiardii', 'Typhlops diardii', 'Schlegel, 1839', 'Rắn giun lớn', 'SPA_04974', 'ó bụng phẳng rõ rệt; có 22-25 vảy quanh thân; đầu phẳng, rộng hơn thân, đuôi ở lỗ huyệt rộng hơn dài; đôi mắt to với con ngươi rõ ràng; sứt mũi không đầy đủ; một hố tuyến dưới mũi lớn, khe mũi tiếp xúc với môi thứ hai; các tuyến vảy ở đầu được giới hạn trong các khớp, đi xuống thành các hàng chẩn đoán song song trên các cơ trên môi; mũi sau chồng lên nhau ở môi thứ nhất và thứ hai, ở trên môi thứ ba chồng lên nhau bởi mắt trước và chồng lên nhau ở mắt; mắt chồng lên môi thứ tư; các vi nốt nằm rải rác trên bề mặt của tất cả các vảy đầu; lưng màu nâu nhạt, bụng màu trắng bẩn; đuôi có phần bụng cong, chóp tròn, có gai nhọn khỏe. ', NULL, 'Ấn Độ (Assam; Mizoram, Arunachal Pradesh, Nagaland), Nepal, Bangladesh, Bhutan, Myanmar (Miến Điện), Việt Nam, Đông Dương, Campuchia (NW Cardamom Mountains), Thái Lan, Lào (Champasak, Houaphan và Xiangkhoang, Bolikhamxai), Nam Trung Quốc (Hải Nam, Vân Nam)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://reptile-database.reptarium.cz/species?genus=Argyrophis&species=diardii'),
(4921, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Typhlopidae', 'Rắn Giun', 'FAM_385', 'Typhlops', NULL, 'GEN_2008', 'typhlopsmuelleri', 'Typhlops muelleri', 'Boulenger, 1893', 'Rắn giun', 'SPA_04975', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4922, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Typhlopidae', 'Rắn Giun', 'FAM_385', 'Typhlops', NULL, 'GEN_2008', 'typhlopssiamensis', 'Typhlops siamensis', 'Günther, 1864', 'Rắn giun thái lan', 'SPA_04976', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4923, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Varanidae', 'Kỳ Đà', 'FAM_390', 'Varanus', NULL, 'GEN_2028', 'varanusbengalensis', 'Varanus bengalensis', '(Duadin, 1802)', 'Kỳ đà vân', 'SPA_04977', 'iêu thị không to; vảy bụng xếp ngang 88-110; đuôi bị nén suốt chiều dài, có mào răng kép thấp phía trên', NULL, 'SE Iran, Afghanistan, Pakistan, N Ấn Độ (Assam, Himachal Pradesh, Jammu và Kashmir, Madhya Pradesh, Tamil Nadu, Gujarat, Mizoram , Maharashtra, Kerala, Punjab, v.v.), Bhutan, Nepal, Sri Lanka, Bangladesh, Myanmar (= Miến Điện), Thái Lan (bao gồm Phuket), Bắc Việt Nam, Lào, Campuchia, Tây Malaysia, Pulau Tioman, Indonesia (Java), Trung Quốc (Vân Nam)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://reptile-database.reptarium.cz/species?genus=Varanus&species=bengalensis'),
(4924, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Varanidae', 'Kỳ Đà', 'FAM_390', 'Varanus', NULL, 'GEN_2028', 'varanusnebulosus', 'Varanus nebulosus', '(Gray, 1831)            ', 'Kỳ đà vân', 'SPA_04978', 'Có cơ thể dài tới 2m, kích thước và hình dáng tương tự như Kỳ đà hoa, song đuôi chúng không dẹp bên, lỗ mũi là một khe xiên có vị trí gần mắt hơn đầu mõm, lưng có màu xám hay nâu nhạt với những đốm vàng nhỏ rải rác, các chi có những vết màu đen nhạt nằm theo chiều ngang và có những vân đen, bụng có nhiều vân nâu xám và vàng. Sống chủ yếu ở vùng rừng núi, những môi trường khô ráo ít nhiều gắn bó với các vực nước. Chúng ẩn trong những hang sâu dưới những tảng đá hoặc trong đám rễ cây. Một khi Kỳ đà đã lọt vào trong hang thì khó mà có thể lôi chúng ra ngoài, do chúng phình to thân bám chặt lấy thành trong của hang. Chúng bơi giỏi, leo trèo giỏi thường kiếm ăn trên mặt đất hoặc trên cây, ăn côn trùng, thằn lằn, chim và thú nhỏ, đôi khi phá cả tổ chim để ăn trứng và chim non. Gặp nguy hiểm Kỳ đà vân có thể nằm giả chết, ngay cả khi nhấc đuôi lên, chúng vẫn không cử động. Trong mùa sinh sản, các cá thể đực đánh nhau để giành cá thể cái. Vào mùa mưa, Kỳ đà vân đẻ khoảng 24 trứng có vỏ dai vào hố do chúng tự đào rồi dùng mõm để lấp đất lên hố có chứa ổ trứng.', NULL, 'Quảng Trị, Thừa Thiên - Huế, Kontum, Gia Lai, Đắk Lắk, Bình Phước, Đồng Nai, Kiên Giang, Bà Rịa - Vũng Tàu. Nam Mianma, Thái Lan, Inđônêxia.', NULL, NULL, 'Cũng như Kỳ đà hoa, kỳ đà vân có giá trị thẩm mỹ nên thường được nuôi trong các vườn động vật để giáo dục môi trường cho học sinh, sinh viên.', 'EN', NULL, NULL, 'vncreatures.net'),
(4925, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Varanidae', 'Kỳ Đà', 'FAM_390', 'Varanus', NULL, 'GEN_2028', 'varanussalvator', 'Varanus salvator', '(Laurenti, 1786)            ', 'Kỳ đà hoa/K.đà nước', 'SPA_04979', 'Đặc điểm nhận dạng:\nKỳ đà hoa có cơ thể dài tới 2,5m; cá thể cái có cơ thể nhỏ hơn. Đây là loài thằn lằn có cỡ lớn nhất thuộc họ Kì đà Varanidae ở nước ta, có đầu thuôn dài, cổ dài, mõm dài và hơi dẹp có hai lỗ mũi hình bầu dục ở vị trí gần mõm hơn là gần mắt. Lưỡi dài mảnh, đầu lưỡi chẻ đôi; lưỡi luôn luôn thò ra thụt vào qua khe miệng như lưỡi rắn. Cơ thể to dài, còn đuôi dẹp bên, sống đuôi rất rõ. Cá thể non có lưng màu đen với những vết vàng nhỏ và to hình tròn xếp theo hàng ngang. Mõm có những vạch ngang rất rõ trên các vảy môi. Có một đường đen đi từ mắt đến thái dương. Cá thể trưởng thành thân có màu nâu vàng lục. Những hoa văn ở cá thể non trở nên ít rõ và càng khó phân biệt ở những cá thể già.\nSinh học, sinh thái:\nThường sống ở bờ sông, bờ suối trung du và miền núi hay các khu rừng ngập mặn cửa sông ven biển. Chúng ẩn trong khe đá hay các hang hốc dưới các gốc cây hoặc trong các bờ bụi. Bơi lặn giỏi, có thể lặn lâu tới 20 – 30 phút. Kì đà ăn động vật: cua, ếch, nhái, cá là những con mồi ưa thích. Ngoài ra chúng còn ăn cả trứng, chim non, thú nhỏ, thằn lằn và côn trùng cỡ lớn. Cá thể non ăn côn trùng. Chúng thường bắt mồi vào ban ngày, sục sạo trong các bờ sông suối, những môi trường nước cạn và trong các bụi rậm. Bắt mồi bằng cách rình mồi và vồ mồi; đôi khi Kì đà dùng lưỡi đầu chẻ đôi để đánh hơi theo dấu vết của con mồi; nếu mồi quá to kì đà thường dùng răng và chi trước để xé mồi. Buổi trưa những ngày nắng nóng, chúng thường ẩn trong các hang hốc, trong bụi cây gần nước hoặc ngâm mình trong nước. Bắt đầu hoạt động vào buổi chiều cho tới hoàng hôn. Sau đó tìm về hang để trú đêm.\nĐẻ trứng vào mùa hè khoảng từ tháng 4, 5 đến tháng 7, 8. Đẻ khoảng 15 tới 20 trứng trong các hang hốc bên bờ sông hoặc trong các hang hốc trong các bờ bụi gần nước. Trứng có màu trắng bẩn, thuôn hai đầu, dài khoảng 5 cm.', NULL, 'Trong nước: Cao Bằng, Lào Cai, Lai Châu, Bắc Kạn, Lạng Sơn, Sơn La, Vĩnh Phúc, Hoà Bình, Bắc Giang, Quảng Ninh, Hải Dương, Hà Tây, Phú Thọ, Ninh Bình, Thanh Hoá, Nghệ An, Hà Tĩnh, Thừa Thiên – Huế, Quảng Nam, Gia Lai, Kontum, Đồng Nai, Đắk Lắk, Lâm Đồng, Bình Phước, Bình Thuận, Bạc Liêu, Bà Rịa – Vũng Tàu, Cà Mâu\nThế giới: Ấn Độ, Xri Lanka, Bănglađét, nam Trung Quốc, Mianma, Lào, Thái Lan, Cămpuchia, Malaixia, Xingapo, Inđônêxia, Philippin.', NULL, NULL, 'Kì đà có kích thước cỡ lớn, da đẹp, hiền, có giá trị thẩm mỹ được nuôi trong các vườn động vật. Nếu được phép nuôi thương phẩm trong các trang trại để nhân giống và lấy da, thì có thể dược sử dụng làm đồ mỹ nghệ có giá trị thương mại cao.', 'EN', NULL, NULL, 'vncreatures.net'),
(4926, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Azemiops', NULL, 'GEN_0194', 'azemiopsfeae', 'Azemiops feae', '(Boulenger, 1888)', 'Rắn lục đầu đen', 'SPA_04980', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4927, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Calloselasma', NULL, 'GEN_0290', 'calloselasmarhodostoma', 'Calloselasma rhodostoma', 'Kuhl', 'Rắn choàm quạp', 'SPA_04981', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4928, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Cryptelytrops', NULL, 'GEN_0492', 'cryptelytropsalbolabris', 'Cryptelytrops albolabris', '(Gray, 1842)            ', 'Rắn lục mép trắng', 'SPA_04982', 'Đặc điểm nhận dạng:\n\nKích thước trung bình, con cái lớn hơn con đực. Chiều dài thân con đực 600 mm, con cái dài 810 mm; chiều dài đuôi con đực 120 mm, con cái 130 mm. Thân tròn, các vảy gồ lên. Đầu và thân màu xanh lá cây, cằm, cổ họng và bụng màu xanh lục nhạt hay trắng vàng nhạt. Rắn đực có sọc trắng trên hàng vảy thân đầu tiên mà ở rắn cái sọc này rất mờ nhạt hoặc không có. Đuôi màu nâu đỏ nhạt.\n\nSinh học, sinh thái:\n\nLoài bò sát này thường thích sống ở vùng đồi núi có độ cao dưới 400m, trong các khu rừng thường xanh, đầm lầy hay các khu đất nông ngiệp. Thức ăn của chúng là chuột, chim, thằn lằn và ếch vào ban đêm trên mặt đất và nghỉ ngơi trên cây vào ban ngày. Mỗi lứa đẻ gồm từ 7 đến 16 rắn con có đặc điểm giống hệt rắn trưởng thành, dài 12 - 18cm. Có nọc độc và nguy hiểm. Loài rắn này gây ra nhiều vết thương nguy hiểm do vết cắn của chúng.\n\nĐây là loài đặc trưng trong họ Rắn lục Viperidae có hiện tượng \"\"đẻ con trứng\"\" vì noãn trong buồng trứng của loài này đã phát triển thành con trong bụng mẹ khi đẻ ra con non chui khỏi vỏ trứng phát triển mà không qua giai đoan ấp ở môi trường, nhiệt độ bên ngoài như một số loài rắn khác. Hiện tượng này khiến cho nhiều người hiểu lầm là loài rắn có khả năng đẻ ra con. Bò sát là những loài động vật đẻ trứng', NULL, 'Việt Nam: Đây là loài có mặt hầu như trên khắp lãnh thổ Việt Nam từ Cao Bằng cho đến Kiên Giang, Minh Hải.\n\nThế giới: Loài của châu Á nhiệt đới và phân bố trên khắp Thái Lan ngoài ra chúng còn có ở Trung Quốc, Ấn Độ, Lào, Cambodia, Malaixia, Indonesia.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4929, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Cryptelytrops', NULL, 'GEN_0492', 'cryptelytropsmacrops', 'Cryptelytrops macrops', 'Kramer, 1977', 'Rắn lục mac rop ', 'SPA_04983', 'Nó có thể được phân biệt với các loài rắn hổ lục khác nhờ kích thước mắt tương đối lớn, điều này đặc biệt dễ nhận thấy ở các mẫu vật trưởng thành', NULL, 'Nó được tìm thấy ở Đông Nam Á ở miền bắc Campuchia , Lào , Thái Lan và miền nam Việt Nam', NULL, 'Loài rắn độc đặc hữu của Đông Nam Á', NULL, NULL, NULL, NULL, NULL),
(4930, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Deinagkistrodon', NULL, 'GEN_0553', 'deinagkistrodonacutus', 'Deinagkistrodon acutus', '(Gunther, 1888)            ', 'Rắn lục mũi hếch', 'SPA_04984', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4931, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Ovophis', NULL, 'GEN_1411', 'ovophismonticola', 'Ovophis monticola', '(Gunther, 1854)            ', 'Rắn lục núi', 'SPA_04985', 'Loài rắn có kích thước trung bình thân hình trụ tròn, ngắn, chắc. Đầu hình tam giác, mặt trên phủ những vảy nhỏ. Mắt nhỏ, mõm rất ngắn bằng 2 lần dài hơn đường kính mắt. Vảy trên đầu nhẵn. Vảy trên đầu nhẵn, xếp gối. Tấm trên mắt rộng, nguyên, dài hơn đường kính mắt. Có từ 6 -7 vảy trung gian giữa hai tấm trên mắt. tấm gian mũi rộng hơn dài, cách nhau bởi 1 - 2 tấm vảy rất bé ở trước và chạm nhau ở phần sau.Vảy vùng thái dương nhẵn.\nTấm mép trên có 8 - 9 vảy, tấm thứ nhật hoàn toàn tách biệt với tấm mũi, tấm thứ hai và thứ ba tiếp xúc với phía dưới vảy viền hố má, tấm thứ ba lớn nhất. Có từ 2 - 3 hàng vảy nhỏ giữa các tấm mép trên và các vảy dưới mặt nhỏ. Mỗi bên mép dưới có 11 vảy, cặp vảy đầu tiên tiếp xúc với nhau sau tấm cằm có hình tam giác, Một cặp tva3y sau cằm, tiếp xúc với vảy mép dưới thứ nhất và thứ hai. Vảy thân 25: 23: 17 hàng, có gờ mảnh, hàng vảy tiếp giáp với vảy bụng nhẳn. 135 vảy bụng, 55 vảy dưới đuôi kép. Tấm hậu môn nguyên. Mặt lưng nâu nhạt hay nâu thẫm có những vết lớn màu nâu thẫm hơn xếp không đều. Hai bên sườn có những vết nhỏ. Mặt bụng màu trắng hay vàng. Chiều dài cơ thể khoảng trên 500mm. Thức ăn chủ yếu của rắn lục núi là thú nhỏ như chuôt, ngoài ra còn có chim, thằn lằn và ếch nhái. Rắn đẻ 5 - 10 trứng trong một hốc đất hay trên đống rác gần những mảnh thực vật. Trứng được rắn mẹ canh giữ cho đến khi nở. Rắn con mới nở dài khoảng 160 - 180mm. Thường ở vùng rừng núi, có độ cao lên tới 1.500m. Chúng còn sống gần nơi ở của người như vườn, những bụi rậm gần trường học hay sân chơi. Rắn sinh hoạt về ban đêm.', NULL, 'Việt Nam: Lào Cai, Yên Bái, Lạng Sơn, Vĩnh Phú, Hà Nội, Quảng Trị, Quảng Nam - Đà Nẵng, Lâm Đồng. Gia Lai, Kontum Thế giới: Nêpan, Ấn Độ, Mianma, Trung Quốc, Lào, Campuchia, Malaixia, đảo Xumatơra.', NULL, NULL, 'Rắn lục núi là loài rắn độc cắn chết người. Chúng có giá trị khoa học.', 'R', NULL, NULL, 'Vn Creature'),
(4932, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Ovophis', NULL, 'GEN_1411', 'ovophistonkinensis', 'Ovophis tonkinensis', '(BOURRET, 1934)', 'Rắn lục bắc bộ', 'SPA_04986', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4933, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Protobothrops', NULL, 'GEN_1638', 'protobothropscornutus', 'Protobothrops cornutus', '(SMITH, 1930)', 'Rắn lục sừng', 'SPA_04987', 'Đặc điểm nhận dạng:\nRắn cỡ nhỏ. Đầu hình tam giác phân biệt rõ với cổ. Mặt trên đầu phủ vảy nhỏ, có vảy trên mắt phát triển thành cái sừng trên mắt, có hõm má. Mặt lưng màu nâu xám có 2 dãy vết sẫm lớn, các vết này thường nối với nhau thành vạch ngang; mặt bụng màu trắng có những vết chấm nâu. Kích thước trung bình của cơ thể: 500mm.\nSinh học, sinh thái:\nLoài này được tìm thấy trên mặt đất trong rừng thường xanh và trên núi đá vôi hay các mỏm đá granit. Thỉnh thoảng gặp chúng săn mồi ban đêm ở các khu rừng phục hồi ở các khu vực núi đá vôi.', NULL, 'Việt Nam: Lào Cai (Fan Si Pan), Thừa Thiên - Huế (Bạch Mã), Phong Nha - Kẻ Bàng.\nThế giới: Không có.', NULL, NULL, 'Rắn lục sừng là loài rắn độc, có giá trị về mặt khoa học, thẩm mỹ.', NULL, 'R', NULL, 'vncreatures.net'),
(4934, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Protobothrops', NULL, 'GEN_1638', 'protobothropsmucrosquamatus', 'Protobothrops mucrosquamatus', '(Cantor, 1839)            ', 'Rắn lục cườm', 'SPA_04988', 'Mõm hai lần dài hơn đường kính mắt. Vảy trên đầu rất bé, xếp cạnh nhau. Tấm trên ổ mắt dài và hẹp, nguyên, dài hơn chiều dài ổ mắt một chút; có 14 – 16 vảy trung gian giữa các tấm trên ổ mắt. Tấm gian mũi dài, hình bầu dục, dài hơn các vảy bên cạnh 2 - 2,5 lần; có 2 vảy nhỏ giữa hai tấm gian mũi. Có 3 vảy dọc theo đường giữa tấm gian mũi và tấm trên mắt. Tấm dưới mắt dài và hẹp, cách biệt với các tấm mép trên bởi 2 hàng vảy nhỏ. Vùng thái dương có 3 hàng vảy rộng, nhẵn. Có 9 tấm mép trên mỗi bên, tấm mép trên thứ nhất tách biệt với tấm mũi, tấm thứ hai tạo thành viền trước hố má, tấm thứ ba dài nhất; 14 - 15 tấm mép dưới ở mỗi bên. Có 1 cặp tấm sau cằm tiếp xúc với tấm mép dưới thứ nhất và thứ hai. Vảy thân 25: 25: 19 hàng, có gờ rõ; 216 vảy bụng; 92 vảy dưới đuôi kép. Tấm hậu môn nguyên.\nThân màu nâu sáng. Mặt trên đầu, vùng mõm đến cạnh sau của hàm và mặt dưới đầu màu nâu sẫm. Có một vệt trắng từ phía sau của mắt kéo dài đến khớp lồi của hàm, phía dưới là một vệt đen hẹp hơn. Dọc giữa hai bên sống lưng đến 1/2 chiều dài phía trước thân có các đốm màu nâu đen, nửa phía sau thân các đốm này xếp xen kẽ nhau. Hai bên thân ngang với các đốm trên lưng có các vệt nâu đen kéo xuống sát tấm bụng. Loài rắn độc gây nguy hiểm cho người thường sống ở sinh cảnh rừng thứ sinh, ven suối thuộc khu vực suối. Thức ăn là các loài thú ăn thịt nhỏ và các loài ếch nhái sống trong khu vực phân bố. Gặp ở độ cao thấp đến 1000m. Kiếm ăn đêm, ban ngày chiu rúc trong hang, hốc và dưới các thảm mục thực vật.', NULL, ' Lào Cai, Hà Giang, Cao Bằng, Bắc Kạn, Lạng Sơn, Thái Nguyên, Vĩnh Phúc, Hà Nội (Ba Vì), Quảng Ninh, Hải Phòng, Hải Dương, Ninh Bình, Nghệ An, Hà Tĩnh, Quảng Trị, Thừa Thiên-Huế, Kon Tum, Gia Lai. Trĩ Sao, khu vực xung quanh trụ sở Vườn quốc gia. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(4935, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Trimeresurus', NULL, 'GEN_1990', 'trimeresurusalbolabris', 'Trimeresurus  albolabris', 'Gray, 1842.', 'Rắn lục mép trắng', 'SPA_04989', 'Vảy thành 21 (hiếm khi 19) hàng dọc ở giữa thân; 1–11(12) môi trên, môi đầu tiên dính một phần hoặc hoàn toàn vào mũi; vảy đầu nhỏ, không đều nhau, xếp nếp yếu, nhẵn hoặc gồ ghề yếu; siêu thị hẹp, đôi khi to ra, không phân chia, có 8–12 vảy nội nhãn giữa chúng; vảy thái dương nhẵn; phía trên màu xanh, phía dưới mắt màu vàng, trắng hoặc xanh nhạt, nhạt hơn nhiều so với phần còn lại của đầu; phía dưới, màu xanh lục, hơi vàng hoặc trắng, phía dưới có sọc nhạt ở bụng ở tất cả con đực, không có ở con cái; cuối đuôi không có đốm nâu; bụng: con đực 155–166, con cái 152–176; phần dưới đuôi: con đực 6–72, con cái 49–66, ghép đôi; hemipenes không có gai. Tổng chiều dài con đực 6 mm, con cái 81; chiều dài đuôi con đực 12 mm, con cái 13 mm', NULL, 'Nepal, Bhutan, Miến Điện, Thái Lan, Campuchia, Lào, Việt Nam (Hòa Bình, Yên Bái, Hải Phòng, v.v.), Nam Trung Quốc (từ phía đông Vân Nam đến Quảng Đông và Hải Nam, phía bắc đến An Huy; Phúc Kiến, Kwangsi, Phúc Kiến), Indonesia ( Sumatra, Java, Lombok, Sumbawa, Komodo, Sumba, Flores, Roti, Wetar, Kisar)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://reptile-database.reptarium.cz/species?genus=Trimeresurus&species=albolabris'),
(4936, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Trimeresurus', NULL, 'GEN_1990', 'trimeresuruscornutus', 'Trimeresurus cornutus', 'Smith.', 'Rắn lục sừng', 'SPA_04990', 'Size nhỏ. Đầu hình tam giác phân biệt với cổ. Mặt trên phủ gầm nhỏ, có gầm trên mắt phát triển thành cái sừng trên mắt, có hõm má. Mặt sau màu nâu xám có 2 dãy vết đậm, các vết này thường kết nối với nhau thành vạch ngang; mặt bụng màu trắng có những dấu chấm màu nâu. Kích thước trung bình của cơ sở: 500mm. Điều này được tìm thấy trên mặt đất trong rừng thường xanh và trên núi đá vôi hay đá granit đá mỏ. Tốc độ săn bắn ban đêm ở các khu rừng phục hồi ở các khu vực núi đá vôi.', NULL, 'Lào Cai (Fan Si Pan), Thừa Thiên - Huế (Bạch Mã), Phong Nha - Kẻ Bàng. ', NULL, NULL, 'Rắn lục là loài rắn độc, có giá trị về mặt khoa học, thẩm mỹ.', 'R', NULL, NULL, 'vncreatures'),
(4937, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Trimeresurus', NULL, 'GEN_1990', 'trimeresurusgramineus', 'Trimeresurus gramineus', '(Shaw, 1802)', 'Rắn lục mép', 'SPA_04991', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4938, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Trimeresurus', NULL, 'GEN_1990', 'trimeresurusjerdoni', 'Trimeresurus jerdoni', 'Günther, 1875.', 'Rắn lục giecđôn', 'SPA_04992', 'Đầu rộng hơn cổ một cách rõ rệt. Thân hình trụ. Đuôi bằng 1/7 chiều dài thân, chót đuôi nhọn. Vảy đầu phía trên nhỏ, không bằng nhau, mịn, lợp vừa sát lên nhau. Vảy trên ổ mắt lớn và nguyên vẹn. Vảy môi trên đầu tiên gần như tách biệt với mũi, vảy thứ ba lớn nhất. Một hàng vảy đơn giữa vảy môi trên và dưới ổ mắt. Vảy thái dương mịn. Vảy thân lưng hết sừng mạnh. Vảy thân lưng đầu tiên ở một trong hai mặt bên giữa thân. Lưng hầu như có màu đen, một vài vảy có kẻ sọc màu vàng chanh. Một dãy vết loang màu đỏ nâu không đều, hình thoi có viền đen trên lưng. Da giữa kẽ vảy màu đen. Đỉnh đầu màu đen có vết vàng sẫm đối xứng. Vảy trên mắt màu đen có vết vàng. Hai mặt bên của đầu màu vàng chanh có sọc sau mắt màu đen rộng, tách biệt với mặt lưng màu đen của đầu bởi một sọc vàng hẹp. Vảy môi trên màu vàng có hai đốm đen, một đốm ở dưới mắt, đốm còn lại dưới hốc má. Mặt dưới đầu và cổ có màu vàng sáng. Vảy bụng màu vàng mờ, lốm đốm đen, dần chuyển sang đen, vô số những đốm vàng. Đuôi và phần sau bụng gần như màu đen.\nSinh học sinh thái:\nSống ở độ cao tứ 1.800 đến 2.350m trong các khu rừng thường xanh núi cao ẩm và lạnh. Thỉnh thoảng gặp kiếm ăn ở các khe suối gần nương rẫy và rừng phục hồi. Thức ăn là những loài bò sát, lưỡng cư sống trong khu vực phân bố. Kiếm ăn ban đêm, gặp vào buổi sáng sớm khi nhiệt độ xuống thấp, chúng gần như bất động và  chỉ hoạt động mạnh khi nhiệt độ tăng cao. Đây là loài rắn độc nguy hiểm, nọc độc tế bào của chúng gây chết người nếu không kịp thời cứu chữa.', NULL, 'Trong nước: Lào Cai (Vườn quốc gia Hoàng Liên), Sơn La, Lai Châu.\nNước ngoài: Quảng Tây, đảo Hải Nam, Vân Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=3&loai=1&img=1&ID=5983'),
(4939, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Trimeresurus', NULL, 'GEN_1990', 'trimeresurusmucrosquamatus', 'Trimeresurus mucrosquamatus', '(CANTOR, 1839)', 'Rắn lục cườm', 'SPA_04993', 'Mõm hai lần dài hơn đường kính mắt. Vảy trên đầu rất bé, xếp cạnh nhau. Tấm trên ổ mắt dài và hẹp, nguyên, dài hơn chiều dài ổ mắt một chút; có 14 – 16 vảy trung gian giữa các tấm trên ổ mắt. Tấm gian mũi dài, hình bầu dục, dài hơn các vảy bên cạnh 2 - 2,5 lần; có 2 vảy nhỏ giữa hai tấm gian mũi. Có 3 vảy dọc theo đường giữa tấm gian mũi và tấm trên mắt. Tấm dưới mắt dài và hẹp, cách biệt với các tấm mép trên bởi 2 hàng vảy nhỏ. Vùng thái dương có 3 hàng vảy rộng, nhẵn. Có 9 tấm mép trên mỗi bên, tấm mép trên thứ nhất tách biệt với tấm mũi, tấm thứ hai tạo thành viền trước hố má, tấm thứ ba dài nhất; 14 - 15 tấm mép dưới ở mỗi bên. Có 1 cặp tấm sau cằm tiếp xúc với tấm mép dưới thứ nhất và thứ hai. Vảy thân 25: 25: 19 hàng, có gờ rõ; 216 vảy bụng; 92 vảy dưới đuôi kép. Tấm hậu môn nguyên.\n\nThân màu nâu sáng. Mặt trên đầu, vùng mõm đến cạnh sau của hàm và mặt dưới đầu màu nâu sẫm. Có một vệt trắng từ phía sau của mắt kéo dài đến khớp lồi của hàm, phía dưới là một vệt đen hẹp hơn. Dọc giữa hai bên sống lưng đến 1/2 chiều dài phía trước thân có các đốm màu nâu đen, nửa phía sau thân các đốm này xếp xen kẽ nhau. Hai bên thân ngang với các đốm trên lưng có các vệt nâu đen kéo xuống sát tấm bụng. Loài rắn độc gây nguy hiểm cho người thường sống ở sinh cảnh rừng thứ sinh, ven suối thuộc khu vực suối. Thức ăn là các loài thú ăn thịt nhỏ và các loài ếch nhái sống trong khu vực phân bố. Gặp ở độ cao thấp đến 1000m. Kiếm ăn đêm, ban ngày chiu rúc trong hang, hốc và dưới các thảm mục thực vật.', NULL, 'Việt Nam: Lào Cai, Hà Giang, Cao Bằng, Bắc Kạn, Lạng Sơn, Thái Nguyên, Vĩnh Phúc, Hà Nội (Ba Vì), Quảng Ninh, Hải Phòng, Hải Dương, Ninh Bình, Nghệ An, Hà Tĩnh, Quảng Trị, Thừa Thiên-Huế, Kon Tum, Gia Lai. Trĩ Sao, khu vực xung quanh trụ sở Vườn quốc gia. ', NULL, NULL, NULL, NULL, NULL, NULL, 'Vn Creature'),
(4940, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Trimeresurus', NULL, 'GEN_1990', 'trimeresuruspopeorum', 'Trimeresurus popeiorum', 'Smith, 1937', 'Rắn lục miền nam', 'SPA_04994', 'Đỉnh đầu và thân màu xanh lục vừa, phần bụng màu xanh lục nhạt hơn. Một cuộc đua trắng ở phần Cuồng mời được viền màu cam hoặc đỏ đậm, chạy dọc theo hàng đầu tiên trên thân. Đôi khi các con đực có đường trắng sau mắt. Đuôi có màu nâu đỏ nhạt. Rửa sạch, cày bừa lên. loài bò sát ăn đêm này phần lớn thường được tìm thấy trên các loại nước thải, lùm cây thấp ở địa hình đồi núi có độ cao từ 900m đến 1,500m . Thức ăn của loài này vẫn chưa được biết đến. Mỗi con sinh sản khoảng 7 - 12 con, rắn con dài 12 - 1 8cm. Có độc và nguy hiểm.', NULL, 'Gia Lai (Nông trường Sông Ba), Sơklang, Đồng Nai (Chứa Chan), Lâm Đồng (Bảo Lộc), Minh Hải (Năm Căn). : loài rắn này có rất nhiều ở phía Bắc và phía Nam Thái Lan, phía Tây Mã Lai xuống phía Nam tận Pulau Tioman, Đông Bắc Ấn Độ, Myanmar, Đông dương , đảo Sumatra và phía Tây Mã Lai .', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(4941, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Trimeresurus', NULL, 'GEN_1990', 'trimeresurusrubeus', 'Trimeresurus rubeus', '(Malhotra, Thorpe, Mrinalini & Stuart, 2011)', 'Rắn lục mắt đỏ', 'SPA_04995', 'Loài rắn có kích thước trung bình, chiều dài mút mõm đến hậu môn (SVL) đạt tới 51 cm; vảy lưng có gờ, có 21 hàng vảy quanh giữa thân; 159 - 172 vảy bụng; 52 - 74 vảy dưới đuôi; mắt màu nâu đỏ; thân màu xanh lá cây, con cái có sọc trắng chạy từ mũi dọc theo sườn về phía hậu môn, con đực có thêm một sọc màu đỏ phía dưới sọc trắng. Đầu lớn hơn cổ, lỗ mũi cách xa hốc mắt. oài bò sát kiếm ăn đêm thường sống ở khu vực rừng thường xanh còn tốt. Xuất hiện quanh các khu vực vũng nước trong rừng để tìm kiếm thức ăn là các loài ếch nhái …và chỉ xuất hiện vào mùa mưa. Sống cùng sinh cảnh với loài rắn lục đuôi đỏ Trimeresurus albolabris.Tên loài có nguồn gốc từ một từ Latin “rubens” có nghĩa là màu đỏ. Loài rắn độc nguy hiểm với nọc độc dạng tế bào, có thể gây chết người', NULL, 'Loài bò sát mới phát hiện năm 2011 ở Vườn quốc gia Cát Tiện, Khu BTTN Vĩnh Cửu tỉnh Đồng Nai và thành phố Hồ Chí Minh. Các mẫu vật của loài này được thu ở sinh cảnh các vùng rừng trên núi đất thấp tới độ cao khoảng 500 m so với mực nước biển. ', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(4942, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Trimeresurus', NULL, 'GEN_1990', 'trimeresurussp', 'Trimeresurus sp', NULL, 'Rắn lục', 'SPA_04996', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4943, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Trimeresurus', NULL, 'GEN_1990', 'trimeresurusstejnegeri', 'Trimeresurus steinegeri', 'K. P. Schmidt, 1925. ', 'Rắn lục xanh', 'SPA_04997', 'Mõm dài bằng 2,5 lần đường kính mắt. Đầu phân biệt rõ với cổ, phủ vảy nhỏ, gối nhau ở gốc. Vảy trên đầu nhẵn; vảy vùng trung gian ổ mắt nhỏ hơn các vảy trên đầu. Có 11 - 13 vảy trung gian giữa hai tấm trên mắt. Tấm trên mắt dài và hẹp, vượt quá ổ mắt về trước. Có 2 tấm dưới mắt dài và hẹp, 2 tấm sau mắt nhỏ. Tấm gian mũi 1,5 - 2 lần lớn hơn các vảy bên cạnh, cách nhau bởi 1 – 3 vảy nhỏ. Vảy vùng thái dương nhỏ, không có gờ. Các vảy phía sau thái dương và vùng trước góc hàm rộng hơn, không có gờ. Có 9 - 11 tấm mép trên, tấm mép trên thứ nhất tách biệt hoàn toàn với tấm mũi, tấm thứ hai kéo dài lên phía trên tạo thành viền trước hố má, tấm thứ ba rộng dài nhất. Các tấm mép trên cách biệt với tấm dưới mắt từ 1 - 2 hàng vảy. Có 10 - 11 tấm mép dưới mỗi bên, 3 tấm đầu tiên chạm tấm sau cằm trước. Vảy thân 25: 21: 15 hoặc 17 hàng, có gờ rõ; 2 hoặc 3 hàng vảy thân gần vảy bụng nhẵn; 158 - 164 vảy bụng; 62 - 72 vảy dưới đuôi chia. Tấm hậu môn nguyên. Thân xanh đồng màu. Mặt bụng và dưới đuôi xanh nhạt và sáng hơn. Hàng vảy thân tiếp giáp vảy bụng có màu trắng viền vàng, hoặc có nửa trên màu trắng, nửa dưới đỏ gạch tạo thành sọc dọc hai bên thân đến gốc đuôi. Mút đuôi màu nâu đỏ Loài rắn độc gây nguy hiểm cho người thường sống ở sinh cảnh rừng thứ sinh, ven suối thuộc khu vực suối. Thức ăn là các loài thú ăn thịt nhỏ và các loài ếch nhái sống trong khu vực phân bố. Gặp ở độ cao thấp đến 1.000m. Kiếm ăn đêm, ban ngày chiu rúc trong hang, hốc cây. Loài rắn độc, gây nguy hiểm chết người', NULL, 'Lào Cai, Hà Giang, Cao Bằng, Thái Nguyên, Vĩnh Phúc, Bắc Giang, Sơn La, Hoà Bình, Nghệ An, Hà Tĩnh, Quảng Bình, Thừa Thiên-Huế, Đà Nẵng, Gia Lai Nam Trung Quốc, bao gồm Đài Loan và Hải Nam. Ấn Độ, Miến Điện, Lào, và Campuchia.', NULL, NULL, 'Có giá trị nghiên cứu khoa học và góp phần điều hoà số lượng cá thể các quần thể con mồi, giúp cân bằng sinh thái tự nhiên', NULL, 'LC', NULL, 'VnCreature'),
(4944, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Trimeresurus', NULL, 'GEN_1990', 'trimeresurusvogeli', 'Trimeresurus vogeli', 'David, Vidal and Pauwels, 2001', 'Rắn lục vongen', 'SPA_04998', 'Đỉnh đầu và thân màu xanh lục vừa, phần bụng màu xanh lục nhạt hơn. Một sọc trắng ở phần bụng thỉnh thoảng được viền màu cam hoặc đỏ đậm, chạy dọc theo hàng vảy đầu tiên trên thân. Đôi khi các con đực có đường sọc trắng sau mắt. Đuôi có màu nâu đỏ nhạt. Vảy trên đầu trơn nhẵn, vảy thân gồ lên.', NULL, 'Việt Nam: Gia Lai (Nông trường Sông Ba), Sơklang, Đồng Nai (Chứa Chan), Lâm Đồng (Bảo Lộc), Minh Hải (Năm Căn).', NULL, NULL, NULL, NULL, NULL, NULL, 'https://vncreatures.net/chitiet.php?page=3&loai=1&img=1&ID=5037'),
(4945, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Viridovipera', NULL, 'GEN_2038', 'viridoviperastejnegeri', 'Viridovipera stejnegeri', '(Schmidt, 1925). ', 'Rắn lục xanh', 'SPA_04999', 'Mõm dài bằng 2,5 lần đường kính mắt. Đầu phân biệt rõ với cổ, phủ vảy nhỏ, gối nhau ở gốc. Vảy trên đầu nhẵn; vảy vùng trung gian ổ mắt nhỏ hơn các vảy trên đầu. Có 11 - 13 vảy trung gian giữa hai tấm trên mắt. Tấm trên mắt dài và hẹp, vượt quá ổ mắt về trước. Có 2 tấm dưới mắt dài và hẹp, 2 tấm sau mắt nhỏ. Tấm gian mũi 1,5 - 2 lần lớn hơn các vảy bên cạnh, cách nhau bởi 1 – 3 vảy nhỏ. Vảy vùng thái dương nhỏ, không có gờ. Các vảy phía sau thái dương và vùng trước góc hàm rộng hơn, không có gờ.', NULL, 'Việt Nam: Lào Cai, Hà Giang, Cao Bằng, Thái Nguyên, Vĩnh Phúc, Bắc Giang, Sơn La, Hoà Bình, Nghệ An, Hà Tĩnh, Quảng Bình, Thừa Thiên-Huế, Đà Nẵng, Gia Lai.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=6&loai=1&ID=5788'),
(4946, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Viperidae', 'Rắn Lục', 'FAM_393', 'Viridovipera', NULL, 'GEN_2038', 'viridoviperavogeli', 'Viridovipera vogeli', 'P. David, N. Vidal, Pauwell, 2001', 'Rắn lục miền nam ', 'SPA_05000', 'Đặc điểm nhận dạng:\nĐỉnh đầu và thân màu xanh lục vừa, phần bụng màu xanh lục nhạt hơn. Một sọc trắng ở phần bụng thỉnh thoảng được viền màu cam hoặc đỏ đậm, chạy dọc theo hàng vảy đầu tiên trên thân. Đôi khi các con đực có đường sọc trắng sau mắt. Đuôi có màu nâu đỏ nhạt. Vảy trên đầu trơn nhẵn, vảy thân gồ lên.\nSinh học, sinh thái:\nLoài bò sát ăn đêm này phần lớn thường được tìm thấy trên các bụi rậm, lùm cây thấp ở địa hình đồi núi có độ cao từ 900m đến 1.500m. Thức ăn của loài này chưa được biết đến. Mỗi lứa đẻ khoảng 7 - 12 con, rắn con dài 12 - 18cm. Có nọc độc và nguy hiểm.', NULL, 'Việt Nam: Gia Lai (Nông trường Sông Ba), Sơklang, Đồng Nai (Chứa Chan), Lâm Đồng (Bảo Lộc), Minh Hải (Năm Căn).\n\nThế giới: Loài rắn này có rất nhiều ở phía Bắc và phía Nam Thái Lan, phía Tây Mã Lai xuống phía Nam tận Pulau Tioman, Đông Bắc Ấn Độ, Myanmar, Đông dương, đảo Sumatra và phía Tây Mã Lai.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4947, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Xenopeltidae', 'Rắn Mống', 'FAM_395', 'Xenopeltis', NULL, 'GEN_2051', 'xenopeltishainanensis', 'Xenopeltis hainanensis', 'Orlov et al., 2022', 'Rắn mống hải nam', 'SPA_05001', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4948, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'SQUAMATA', 'CÓ VẨY', 'ORD_083', 'Xenopeltidae', 'Rắn Mống', 'FAM_395', 'Xenopeltis', NULL, 'GEN_2051', 'xenopeltisunicolor', 'Xenopeltis unicolor', 'Reinwardt 1827            ', 'Rắn mống', 'SPA_05002', 'Rắn trưởng thành có thể dài tới 1,3 m (51 inch). Các vảy trên đầu là các tấm lớn giống như ở các loài trong họ Rắn nước (Colubridae), trong khi các vảy bụng chỉ hơi bị tiêu giảm. Không có các cơ quan vết tích ở phần khung chậu.\nKiểu màu phần lưng là nâu hay nâu ánh đỏ hoặc ánh đen. Phần bụng có màu xám trắng không có họa tiết trang trí. Vảy có tính chất ngũ sắc cao, tạo ra màu sắc óng ánh dưới ánh sáng', NULL, 'Ba Vì', NULL, NULL, NULL, NULL, NULL, NULL, 'Đỗ Tước và Đặng Thanh Long (2013). Chuyên đề điều tra đa dạng động vật rừng trên địa bàn thành phố Hà Nội. Chi Cục Kiểm lâm Hà Nội'),
(4949, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Batagur', NULL, 'GEN_0211', 'batagurbaska', 'Batagur baska', '(Gray, 1830)', 'Rùa batagu', 'SPA_05003', 'Bề mặt trên của mai và các phần mềm thường có màu nâu ô liu, trong khi yếm có màu hơi vàng. Đầu và cổ có màu nâu với phần gốc màu đỏ. Con đực có màu sinh sản có đầu và cổ màu đen với mặt lưng màu đỏ thẫm hoặc cam và chân trước màu đỏ hoặc cam. Màu sắc của đồng tử cũng thay đổi trong thời kỳ này, chuyển sang màu nâu ở nữ và trắng vàng ở nam. Trong mùa sinh sản, đồng tử của con cái có màu nâu trong khi con ngươi của con đực chuyển sang màu trắng vàng.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.google.com/search?q=Batagur+baska&oq=Batagur+baska&gs_lcrp=EgZjaHJvbWUqBggAEEUYOzIGCAAQRRg7MgYIARBFGDzSAQc3NTZqMGo3qAIAsAIA&sourceid=chrome&ie=UTF-8'),
(4950, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Cistoclemmys', NULL, 'GEN_0421', 'cistoclemmysgalbimfrons', 'Cistoclemmys galbimfrons', 'BOURRET, 1939', 'Rùa hộp trán vàng', 'SPA_05004', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4951, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Cuora', NULL, 'GEN_0507', 'cuoraamboinensis', 'Cuora amboiensis', 'Daudin, 1802', 'Rùa hộp lưng đen', 'SPA_05005', 'Cỡ trung bình, mai dài khoảng 200mm. Mai phồng, nhẵn. Gờ sống lưng rõ. Yếm gồm hai mảnh cử động được, bờ sau yếm không khuyết. Mai màu xám đen; yếm màu trắng đục, bờ ngoài các tấm ở yếm có vết xám đen. Có 3 sọc màu vàng nhạt ở bên đầu: 1 sọc chạy dài từ mút mõm qua mí mắt trên tới cổ, 2 sọc khác chạy từ mũi qua ổ mắt tới cổ. Rùa sống ở các ao, đầm lầy, kênh rạch, suối, ruộng lúa ngập nước, nơi có nền đất mềm và nước chảy chậm. Thức ăn chủ yếu là cỏ và thực vật thuỷ sinh, đôi khi ăn cả tôm, giun đất. Chúng đẻ vào tháng 4 - 6, mỗi lần đẻ từ 2 - 5 trứng hình bầu dục, kích thước trứng 40 - 46/30 - 34mm.', NULL, 'Gia Lai, Đắk Lắk, Bình Thuận, Bà Rịa - Vũng Tàu, Tây Ninh, Long An, Kiên Giang, Cà Mau. Campuchia, Thái Lan, Mianma, Lào, Malaysia, Indonesia, Philippin.', NULL, NULL, 'Có giá trị nghiên cứu khoa học về sinh thái và tập tính của chúng ở các khu vực đất ngập nước. Loài này được nuôi làm cảnh ở những nơi vui chơi giải trí, vườn thú, nên chúng thường bị buôn bán làm vật nuôi cảnh ở Việt Nam và quốc tế.', 'VU', NULL, NULL, 'vncreatures.net'),
(4952, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Cuora', NULL, 'GEN_0507', 'cuoracyclornata', 'Cuora cyclornata', 'Blanck, McCord and Le, 2006', 'Rùa vàng, rùa hộp ba vạch', 'SPA_05006', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4953, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Cuora', NULL, 'GEN_0507', 'cuoragalbinifrons', 'Cuora galbinifrons', 'Bourret, 1939            ', 'Rùa hộp trán vàng', 'SPA_05007', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4954, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Cuora', NULL, 'GEN_0507', 'cuoramouhotii', 'Cuora mouhoti', '(Gray, 1862)', 'Rùa sa nhân', 'SPA_05008', 'Loài rùa cỡ trung bình này có mai dài 18cm, lưng phẳng có 3 gờ nổi rõ (nhưng không có vệt xám đen). Một gờ ở giữa lưng. Hai gờ chạy dọc từ tấm vẩy 1 đến 4 trên mai. Mai màu vàng hoặc nâu sáng; bờ sau mai có riềm răng cưa. Yếm hẹp hơn độ mở của mai. Đường nối tấm cánh táy xấp xỉ bằng đường nối của tấm họng. Đường nối tấm bụng dài nhất. Cầu ngắn bằng 1/3 bề dài của yếm. Con đực đuôi dài và dầy hơn con cái.\n\nĐầu trung bình, mõm ngắn hơn mắt. Da đầu phân chia thành các tấm lớn. Chi trước có 5 ngón và chi sau có 4 ngón. Mặt dưới các  chi có vảy khá lớn và chỉ có 1/2 màng. Mép tấm bìa và tấm dưới bìa có màu nâu đen. Đầu màu nâu vàng, bên đầu có vệt màu nâu đen nhạt xen với vệt màu trắng. Cằm nâu vàng, chân màu nâu đen, đuôi màu nâu sẫm, gốc đuôi có những hạt nhỏ.\n\nSinh học, sinh thái:\n\nTuy chưa có số liệu về sinh sản của loài này nhưng thức ăn chính của chúng được biết đến là thực vật (cỏ) và chúng thích ăn nhất là giun đất . Loài này sống trong rừng còn tốt, thường ẩn mình dưới các lớp lá mục, cỏ khô, gỗ mục, chúng chỉ xuất hiện kiếm ăn, giao phối vào mùa xuân hè khi nhiệt độ ấm áp và thường ngủ đông trong những tháng nhiệt độ xuống thấp', NULL, 'Việt Nam: Lào Cai (Bảo Hà), Bắc Thái (Thái Nguyên), Vĩnh Phú (Tam Đảo), Hà Tây (Ba Vì) Hoà Bình, Hà Bắc,Ninh Bình, Thanh Hoá (Quan Hoá), Nghệ An (Tân Kỳ)\n\nThế giới: phía Đông Ấn Độ, Trung Quốc, Lào.', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/e_chitiet.php?page=1&loai=1&ID=5076'),
(4955, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Cuora', NULL, 'GEN_0507', 'cuorapicturata', 'Cuora picturata', 'Lehr, Fritz & Obst, 1998', 'Rùa hộp trán vàng', 'SPA_05009', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4956, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Cuora', NULL, 'GEN_0507', 'cuoratrifasciata', 'Cuora trifasciata', '(Bell, 1825)            ', 'Rùa hộp ba vạch', 'SPA_05010', 'Cỡ trung bình, chiều dài mai từ 170 - 200mm. Mai hơi dẹp, bờ sau không có răng cưa. Trên mai có 3 gờ (1 gờ sống lưng, 2 gờ bên). Yếm rùa gồm 2 mảnh cử động được, có thể khép kín vào mai. Lưng màu nâu có 3 vạch màu xám đen chạy dọc theo 3 gờ trên mai. Yếm màu xám đen, viền yếm màu đỏ nâu. Rùa sống ở ven các suối, các khe rãnh trong rừng vùng núi và trung du, phân bố tới độ cao 1000m. Ban ngày, ẩn dưới những đám lá cây mục nát ven suối hoặc khe rãnh, tối mới ra kiếm mồi. Thức ăn là các loại động vật (côn trùng, tôm, cá, ốc,…); tuy nhiên, rùa còn ăn cả quả, rong bèo mọc ven suối; trong điều kiện nuôi còn ăn cả thịt, nội tạng động vật, chuối chín. Rùa sinh sản chủ yếu vào tháng 5 - 7, mỗi lần đẻ 2 trứng.', NULL, 'Cao Bằng, Bắc Kạn, Lạng Sơn, núi Tam Đảo, núi Yên Tử, Thanh Hoá, Nghệ An, Hà Tĩnh, Quảng Trị, Quảng Nam, Kontum, Gia Lai. nam Trung Quốc, bắc Mianma, Lào.', NULL, NULL, 'Có giá trị khoa học, thẩm mỹ giúp học sinh sinh viên tìm hiểu về tập tính sinh thái của loài này trong tự nhiên. Chúng còn được nuôi ở những nơi vui chơi giải trí (vườn động vật).', 'CR', NULL, NULL, 'vncreatures.net'),
(4957, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Damonia', NULL, 'GEN_0545', 'damoniamalayemyssubtrijuga', 'Damonia malayemys subtrijuga', '(SCHLEGEL & MÜLLER, 1845) ', 'Rùa ba gờ', 'SPA_05011', 'Cỡ trung bình, chiều dài mai tới 210mm. Trên mai có 3 gờ rõ ràng, bờ sau mai không có răng cưa. Bờ trước yếm gần thẳng, bờ sau yếm lõm. Đầu to, có sọc màu vàng (1 sọc từ mút mõm qua phía trên ổ mắt về phía cổ, 1 sọc từ mũi qua phía dưới ổ mắt tới cổ và 1 đốm trắng ở phía sau ổ mắt). Mai màu nâu sáng hoặc sẫm, đôi khi nâu đỏ, rìa mai màu trắng đục hay vàng rất nhạt. Yếm vàng nhạt có những đốm xám đen trên từng tấm yếm.', NULL, 'Trong nước: Đồng Nai, Cần Thơ, Kiên Giang, Cà Mau.', NULL, NULL, 'Có giá trị khoa học, thẩm mỹ, giúp học sinh, sinh viên tìm hiểu về tập tính sinh thái của loài này trong tự nhiên. Chúng còn được nuôi ở những nơi vui chơi, giải trí (vườn động vật).', NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5074'),
(4958, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Geoemyda', NULL, 'GEN_0749', 'geoemydaspengleri', 'Geoemyda spengleri', '(Gmelin, 1789)            ', 'Rùa đất spengle', 'SPA_05012', 'Loài rùa đất spengleri là loài rùa cỡ nhỏ, có mai dài, phẳng, hẹp với 3 gờ nổi mũi hếch có các nhánh rõ ràng trên viền mai phía sau  sắc, nhọn, hàm trên cong dạng mỏ vẹt, mắt to, viền ngoài có màu trắng đục. Đầu có sọc màu trắng, gồm 2 đoạn từ sau mắt cho đến hết gáy. Có thể thụt đầu vào trong mai. Yếm sẫm màu, có viền vàng kích thước mai khoảng 11,5cm\n\nSinh học, sinh thái:\n\nĐây là loài sống ở những khu rừng nguyên sinh và thứ sinh, sườn đồi phía Bắc nước ta ở độ cao từ 800 đến 1.500m. Thường gặp nằm dưới lớp thảm mục thực vật hay những tảng đá ven bờ suối nhỏ. Thức ăn chủ yếu của loài này là động vật nhỏ như ốc sên, giun đất và các động vật không xương sống khác ở trong rừng thuộc khu vực phân bố.', NULL, 'Trong nước: Vùng núi đồi phía Bắc Việt Nam Lào Cai, Tuyên Quang, Vĩnh Phúc (Vườn quốc gia Tam Đảo) Bắc Giang, Sơn La, Thanh Hoá, Nghệ An, Đà Nẵng, Quảng Nam.\n\nNước ngoài: Trung Quốc (phía Nam).', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=1&loai=1&ID=5945'),
(4959, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Geoemyda', NULL, 'GEN_0749', 'geoemydatcheponensis', 'Geoemyda tcheponensis', 'Bourret, 1939', 'Rùa đất se pôn', 'SPA_05013', 'Rùa đất sêpôn là loài có kích thước trung bình, mai rùa có thể dài đến 22cm; có một gờ giữa lưng nhưng không rõ rệt. mai màu xám nâu hoặc nâu sẫm. Có vài sọc màu hồng phía dưới cổ mở rộng về phía dưới ổ mắt đến tận mũi và cằm. Con đực có đuôi dài và dầy hơn con cái .', NULL, 'Việt Nam: Lai Châu (Chà Cang), Hoà Bình (Mai Châu) Hà Tĩnh (Vũ Quang), Quảng Trị, Gia Lai (Sơklang), Đồng Nai (VQG Cát Tiên) Thế giới: Lào, Cambodia', NULL, NULL, 'Loài rùa có giá trị khoa học, thẩm mỹ, giúp học sinh, sinh viên tìm hiểu về tập tính sinh thái của loài này trong tự nhiên. Số lượng ít cần được bảo vệ. Nghiêm cấm săn bắt, buôn bán. Cần tổ chức nhân nuôi ở các khu bảo tồn nhằm nhân giống để thả vào môi trường tự nhiên và giữ lại nguồn gen', NULL, NULL, NULL, 'nongnghiepchuyendoiso.wordpress.com'),
(4960, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Hieremys', NULL, 'GEN_0881', 'hieremysannandalii', 'Hieremys annandalei', '(Boulenger, 1903)', 'Rùa răng, càng đước', 'SPA_05014', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4961, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Mauremys', NULL, 'GEN_1167', 'mauremysannamensis', 'Mauremys annamensis', '(Siebenrock, 1903)', 'Rùa Trung bộ', 'SPA_05015', 'Cỡ trung bình, chiều dài mai khoảng 170mm. Mai hơi dẹp, sau mai không có răng cưa, trên mai có 3 gờ chạy dọc, gờ giữa lưng rõ nhất. Đầu màu nâu sẫm hoặc xám đen, mỗi bên có 3 sọc màu vàng: 1 sọc từ sau mũi qua phía trên ổ mắt tới cổ, 1 sọc khác lớn hơn từ mũi qua ổ mắt và màng nhĩ tới cổ và 1 sọc chạy dọc phía dưới hàm tới cổ. Mai màu xám sẫm, yếm màu vàng hay da cam, có những đốm lớn màu đen ở mỗi tấm yếm.', NULL, 'Trong nước: Đà Nẵng, Quảng Nam.', NULL, 'Loài đặc hữu hẹp, chỉ phân bố ở Việt Nam.', 'Có giá trị khoa học, thẩm mỹ giúp học sinh, sinh viên tìm hiểu về tập tính sinh thái của loài này trong tự nhiên.', NULL, NULL, NULL, 'https://www.vncreatures.net/chitiet.php?page=2&loai=1&ID=5073'),
(4962, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Mauremys', NULL, 'GEN_1167', 'mauremysmutica', 'Mauremys mutica', '(Cantor, 1842)            ', 'Rùa câm', 'SPA_05016', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4963, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Mauremys', NULL, 'GEN_1167', 'mauremysnigricans', 'Mauremys nigricans', 'Gray, 1834', 'Rùa đầm cổ đỏ', 'SPA_05017', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4964, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Mauremys', NULL, 'GEN_1167', 'mauremyssinensis', 'Mauremys sinensis', '(Gray, 1834)            ', 'Rùa cổ sọc', 'SPA_05018', 'Loài rùa có kích thước trung binh, mai hơi phồng, gờ sống lưng rõ. Tấm sống thứ nhất có hình 5 cạnh, phía trước rộng hơn phía sau. 4 tấm còn lại rộng hơn tấm thứ nhất và gần bằng nhau. Mép phia1a sau của tấm lưng thứ 5 mở rộng. Các tấm bì 8,9,10 có kích thước lớn. Yếm dài gần bằng mai, bờ trước gần phẳng, bờ sau lõm hình chữ V. Đường nối giữa 2 tấm ngực dài nhất, đường nối giữa 2 tấm cánh tay hẹp nhất và bằng khoảng ½ đường nối hai tấm họng. Đường nối giữa hai tấm ngực bằng đường nối giữa 2 tấm đùi. Bờ phía sau của yếm hơi tròn. Tấm bẹn lớn hơn tấm nách.\n\nĐầu bé, mõm ngắn hơn mắt, vượt qua hàm dưới. Hàm trên có lõm ở giữa, da sau đầu nhẵn, cổ có những hạt nhỏ. Bờ ngoài và mặt trước chi có những vảy lớn. Chi trước 5 ngón chi sau 4 ngón, các ngón có màng hoàn toàn. Mai màu nâu, yếm nhạt, có các vệt nâu sẫm ở các tấm. T6a1m dưới bìa, tấm nách, tấm bẹn có vệt nâu sẫm Trên đầu màu nâu, bên đầu có những sọc đen, trắng xen kẽ sọc nâu. Họng có những sọc nâu nhạt hay nâu hồng. Trên các ngón có vệt màu trắng đục. Phần thân sau và đuôi có các vệt tạo thành đường liên tục hay gián đoạn. Gốc đuôi và gốc chi sau có gai tù. Rùa sống ở suối và đầm lầy, nơi nước chảy chậm hay tĩnh; ăn tạp (côn trùng, giun, cá và thực vật thuỷ sinh).', NULL, 'Trong nước: Vĩnh Phúc, Hà Tây, Thanh Hóa, Nghệ An, Hà Tĩnh, Quảng Nam và Bình phước Thế giới: Vùng phía đông Cambodia và một phần phía Nam lào giáp với Việt Nam.', NULL, NULL, NULL, NULL, NULL, NULL, 'VnCreature'),
(4965, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Ocadia', NULL, 'GEN_1349', 'ocadiasinensis', 'Ocadia siensis', 'Gray, 1834', 'Rùa cổ sọc', 'SPA_05019', 'Đặc điểm nhận dạng:\nLoài rùa nước ngọt có kích thước trung binh, mai hơi phồng, gờ sống lưng rõ. Tấm sống thứ nhất có hình 5 cạnh, phía trước rộng hơn phía sau. 4 tấm còn lại rộng hơn tấm thứ nhất và gần bằng nhau. Mép phia1a sau của tấm lưng thứ 5 mở rộng. Các tấm bì 8,9,10 có kích thước lớn. Yếm dài gần bằng mai, bờ trước gần phẳng, bờ sau lõm hình chữ V. Đường nối giữa 2 tấm ngực dài nhất, đường nối giữa 2 tấm cánh tay hẹp nhất và bằng khoảng ½ đường nối hai tấm họng. Đường nối giữa hai tấm ngực bằng đường nối giữa 2 tấm đùi. Bờ phía sau của yếm hơi tròn. Tấm bẹn lớn hơn tấm nách.\nĐầu bé, mõm ngắn hơn mắt, vượt qua hàm dưới. Hàm trên có lõm ở giữa, da sau đầu nhẵn, cổ có những hạt nhỏ. Bờ ngoài và mặt trước chi có những vảy lớn. Chi trước 5 ngón chi sau 4 ngón, các ngón có màng hoàn toàn. Mai màu nâu, yếm nhạt, có các vệt nâu sẫm ở các tấm. T6a1m dưới bìa, tấm nách, tấm bẹn có vệt nâu sẫm Trên đầu màu nâu, bên đầu có những sọc đen, trắng xen kẽ sọc nâu. Họng có những sọc nâu nhạt hay nâu hồng. Trên các ngón có vệt màu trắng đục. Phần thân sau và đuôi có các vệt tạo thành đường liên tục hay gián đoạn. Gốc đuôi và gốc chi sau có gai tù.\nSinh học, sinh thái:\nLà loài rùa nước ngọt sống ở suối và đầm lầy, nơi nước chảy chậm hay tĩnh; ăn tạp (côn trùng, giun, cá và thực vật thuỷ sinh).', NULL, 'Trong nước: Vĩnh Phúc, Hà Tây, Thanh Hóa, Nghệ An, Hà Tĩnh, Quảng Nam và Bình Phước (Vườn quốc gia Bù Gia Mập)\nThế giới: Vùng phía đông Cambodia và một phần phía Nam Lào giáp với Việt Nam.', NULL, NULL, NULL, NULL, 'EN', NULL, 'vncreatures.net'),
(4966, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Pyxidea', NULL, 'GEN_1702', 'pyxideamouhoti', 'Pyxidea mouhoti', '(Gray, 1862).', 'Rùa Sa Nhân', 'SPA_05020', 'Loài rùa cỡ trung bình này có mai dài 18cm, lưng phẳng có 3 gờ nổi rõ (nhưng không có vệt xám đen). Một gờ ở giữa lưng. Hai gờ chạy dọc từ tấm vẩy 1 đến 4 trên mai. Mai màu vàng hoặc nâu sáng; bờ sau mai có riềm răng cưa. Yếm hẹp hơn độ mở của mai. Đường nối tấm cánh táy xấp xỉ bằng đường nối của tấm họng. Đường nối tấm bụng dài nhất. Cầu ngắn bằng 1/3 bề dài của yếm. Con đực đuôi dài và dầy hơn con cái. Đầu trung bình, mõm ngắn hơn mắt. Da đầu phân chia thành các tấm lớn. Chi trước có 5 ngón và chi sau có 4 ngón. Mặt dưới các  chi có vảy khá lớn và chỉ có 1/2 màng. Mép tấm bìa và tấm dưới bìa có màu nâu đen. Đầu màu nâu vàng, bên đầu có vệt màu nâu đen nhạt xen với vệt màu trắng. Cằm nâu vàng, chân màu nâu đen, đuôi màu nâu sẫm, gốc đuôi có những hạt nhỏ Tuy chưa có số liệu về sinh sản của loài này nhưng thức ăn chính của chúng được biết đến là thực vật (cỏ) và chúng thích ăn nhất là giun đất . Loài này sống trong rừng còn tốt, thường ẩn mình dưới các lớp lá mục, cỏ khô, gỗ mục, chúng chỉ xuất hiện kiếm ăn, giao phối vào mùa xuân hè khi nhiệt độ ấm áp và thường ngủ đông trong những tháng nhiệt độ xuống thấp', NULL, 'Việt Nam: Lào Cai (Bảo Hà), Bắc Thái (Thái Nguyên), Vĩnh Phú (Tam Đảo), Hà Tây (Ba Vì) Hoà Bình, Hà Bắc,Ninh Bình, Thanh Hoá (Quan Hoá), Nghệ An (Tân Kỳ) phía Đông Ấn Độ, Trung Quốc, Lào', NULL, NULL, 'Là loài có giá trị khoa học, thẩm mỹ, giúp học sinh, sinh viên tìm hiểu về tập tính sinh thái của loài này trong tự nhiên', NULL, 'EN', NULL, 'VnCreature'),
(4967, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Emydidae', 'Rùa Đầm', 'FAM_134', 'Sacalia', NULL, 'GEN_1765', 'sacaliaquadriocellata', 'Sacalia quadriocella', '(Siebenrock, 1903)', 'Rùa bốn mắt', 'SPA_05021', 'bộ bốn mắt, phát triển tốt, đầy màu sắc ở đỉnh và sau đầu - thường có sự khác biệt giữa hai giới và đôi khi từ cá thể này sang cá thể khác. Những con mắt này thường có màu vàng ở con non và con cái hoặc màu xanh lam nhạt ở con đực. Trong cả hai trường hợp đều có một chấm đen ở giữa. Mai của Rùa bốn mắt có màu nâu đến hơi đen hoặc xanh đậm và thường có đốm ở mẫu vật trưởng thành, với các vùng sẫm màu hơn tập trung xung quanh các đường nối của vảy. Mai có hình bầu dục và có phần sống chính giữa mềm đi theo tuổi tác. Đầu có màu be sẫm, nhưng đôi khi hơi đen hoặc hơi xanh và có thể có những đốm lốm đốm hoặc đốm sáng, đặc biệt là giữa hàm và tai. Da của con beo có một vài sọc màu vàng, có chiều rộng trung bình và cách đều nhau, bắt nguồn từ nếp gấp da phía sau đầu và biến mất ở gốc cổ. Bàn chân có màng tốt. Giống như nhiều loài, con đực thường có đuôi dài hơn và dày hơn. sống ở suối, suối nhỏ ở vùng rừng, miền núi. Chúng được tìm thấy ở độ cao dưới 500 mét, thường là từ 170 đến 470 mét. hích giun đất, động vật thân mềm, động vật giáp xác và cá nhỏ.', NULL, ' ở Phúc Sơn, Việt Nam, phía bắc An Nam miền trung và miền nam Trung Quốc - bao gồm các tỉnh Quảng Đông, Hải Nam, Quảng Tây, Phúc Kiến và Giang Tây - tới miền đông Lào và miền bắc Việt Nam.', NULL, NULL, NULL, NULL, 'EN', NULL, 'Theturtleroom'),
(4968, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Testudinidae', 'Rùa Núi', 'FAM_367', 'Indotestudo', NULL, 'GEN_0961', 'indotestudoelongata', 'Indotestudo elongata', '(BLYTH, 1854)            ', 'Rùa núi vàng', 'SPA_05022', 'Cơ thể cỡ trung bình, chiều dài mai khoảng 275mm. Trên đầu có nhiều tấm sừng. Mai gồ cao, đôi khi hơi thắt ở giữa. Phía trước yếm phẳng, phía sau yếm lõm sâu. Con đực có đuôi dài, cứng, yếm lõm sâu; con cái có đuôi ngắn, yếm phẳng. Chân hình trụ, ngón chân không có màng da. Mai màu vàng, giữa mỗi tấm vảy có đốm đen. Rùa sống trong rừng nơi có những bụi cây thấp, ở độ cao tương đối thấp. ở miền Nam Việt Nam, về mùa khô, rùa có cá tính trú khô, chúng nằm lì trong bụi và không ăn; sang mùa mưa mới ra hoạt động kiếm ăn. Thức ăn chủ yếu là thực vật: hoa quả, rau xanh, có thể ăn cả nấm, giun đất và ốc sên. Chúng đẻ trứng vào tháng 10 hoặc 11 hàng năm, đẻ từ 4 - 5 trứng, có kích thước 50/40mm và có tập tính vùi trứng trong đất.', NULL, 'Trong nước: Lào Cai, Cao Bằng, Hà Giang, Tuyên Quang, Lạng Sơn, Sơn La, Bắc Giang, Hà Tây, Hòa Bình, Quảng Ninh, Thanh Hóa, Nghệ An, Thừa Thiên-Huế, Quảng Nam, Kontum, Gia Lai, Đắk Lắk, Tây Ninh, Bình Phước, Bình Thuận, Bà Rịa - Vũng Tàu. Thế giới: Trung Quốc, Lào, Cămpuchia, Thái Lan, Mianma, Ấn Độ, Xri Lanka, Malaixia và Philippin.', NULL, NULL, 'Có giá trị khoa học, thẩm mỹ, giúp học sinh, sinh viên tìm hiểu về tập tính sinh thái của loài này trong tự nhiên. Chúng còn được nuôi ở những nơi vui chơi, giải trí (vườn động vật).', 'EN', 'EN', NULL, 'Vn Creature'),
(4969, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Testudinidae', 'Rùa Núi', 'FAM_367', 'Manouria', NULL, 'GEN_1159', 'manouriaimpressa', 'Manouria impressa', '(Gunther, 1882)', 'Rùa núi viền', 'SPA_05023', 'Cỡ trung bình, chiều dài mai khoảng 180 - 206mm. Trên đầu có nhiều tấm sừng. Mai không gồ cao, những tấm vảy ở giữa mai phẳng. Phía trước và phía sau mai có những gai hình răng cưa nhọn và cong lên. Phía trước và sau yếm lõm sâu hình chữ V. Chân hình trụ, ngón chân không có màng da. Mai có những tấm vảy màu nâu nhạt, viền đen. Yếm màu vàng có các tia phóng xạ màu nâu sẫm Rùa sống ở những khe rãnh, thung lũng ẩm ướt tới độ cao 1.500m còn gặp như Sapa. Chúng hoạt động vào buổi chiều, ban ngày trú trong các hang hốc. Rùa ăn các loại quả rụng, mầm cỏ, các loại nấm. Chúng đẻ vào tháng 5 hàng năm.', NULL, 'Trong nước: Lai Châu, Lào Cai, Sơn La, Thanh Hóa, Nghệ An, Hà Tĩnh, Đà Nẵng, Quảng Nam, Kontum, Đắk Lắk, Lâm Đồng, Bình Thuận, Khánh Hòa Thế giới: Trung Quốc, Lào, Thái Lan, Mianma, Malaixia.', NULL, NULL, 'Là loài có giá trị khoa học, thẩm mỹ, giúp học sinh, sinh viên tìm hiểu về tập tính sinh thái của loài này trong tự nhiên. Chúng còn được nuôi ở những nơi vui chơi, giải trí (vườn động vật).', 'VU', NULL, NULL, 'VnCreature'),
(4970, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Testudinidae', 'Rùa Núi', 'FAM_367', 'Testudo', NULL, 'GEN_1936', 'testudoelongata', 'Testudo elongata', '(Blyth, 1853)', 'Rùa núi vàng', 'SPA_05024', 'Cơ thể cỡ trung bình, chiều dài mai khoảng 275mm. Trên đầu có nhiều tấm sừng. Mai gồ cao, đôi khi hơi thắt ở giữa. Phía trước yếm phẳng, phía sau yếm lõm sâu. Con đực có đuôi dài, cứng, yếm lõm sâu; con cái có đuôi ngắn, yếm phẳng. Chân hình trụ, ngón chân không có màng da. Mai màu vàng, giữa mỗi tấm vảy có đốm đen. Rùa sống trong rừng nơi có những bụi cây thấp, ở độ cao tương đối thấp. ở miền Nam Việt Nam, về mùa khô, rùa có cá tính trú khô, chúng nằm lì trong bụi và không ăn; sang mùa mưa mới ra hoạt động kiếm ăn. Thức ăn chủ yếu là thực vật: hoa quả, rau xanh, có thể ăn cả nấm, giun đất và ốc sên. Chúng đẻ trứng vào tháng 10 hoặc 11 hàng năm, đẻ từ 4 - 5 trứng, có kích thước 50/40mm và có tập tính vùi trứng trong đất.', NULL, 'Lào Cai, Cao Bằng, Hà Giang, Tuyên Quang, Lạng Sơn, Sơn La, Bắc Giang, Hà Tây, Hòa Bình, Quảng Ninh, Thanh Hóa, Nghệ An, Thừa Thiên-Huế, Quảng Nam, Kontum, Gia Lai, Đắk Lắk, Tây Ninh, Bình Phước, Bình Thuận, Bà Rịa - Vũng Tàu.  Trung Quốc, Lào, Cămpuchia, Thái Lan, Mianma, Ấn Độ, Xri Lanka, Malaixia và Philippin.', NULL, NULL, 'Có giá trị khoa học, thẩm mỹ, giúp học sinh, sinh viên tìm hiểu về tập tính sinh thái của loài này trong tự nhiên. Chúng còn được nuôi ở những nơi vui chơi, giải trí (vườn động vật).', 'EN', NULL, NULL, 'vncreatures'),
(4971, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Testudinidae', 'Rùa Núi', 'FAM_367', 'Testudo', NULL, 'GEN_1936', 'testudoimpressa', 'Testudo impressa', 'Bourret, 1941. ', 'Rùa núi viền', 'SPA_05025', 'Loài rùa cạn có kích thước trung bình, chiều dài mai khoảng 180 - 206mm. Trên đầu có nhiều tấm sừng. Mai không gồ cao, những tấm vảy ở giữa mai phẳng. Phía trước và phía sau mai có những gai hình răng cưa nhọn và cong lên. Phía trước và sau yếm lõm sâu hình chữ V. Chân hình trụ, ngón chân không có màng da. Mai có những tấm vảy màu nâu nhạt, viền đen. Yếm màu vàng có các tia phóng xạ màu nâu sẫm.\nSinh học, sinh thái:\nRùa sống hoàn toàn trên cạn ở những khe rãnh, thung lũng ẩm ướt tới độ cao 1.500m. Chúng hoạt động kiếm ăn vào buổi chiều, ban ngày trú trong các hang hốc. Rùa ăn các loại quả rụng, mầm cỏ, các loại nấm. Chúng đẻ vào tháng 5 hàng năm. Cũng như các loài rùa nước ngọt khác, chúng có khả năng thụt đầu vào mai để tránh kẻ thù tự nhiên.', NULL, 'Trong nước: Lai Châu, Lào Cai, Sơn La, Thanh Hóa, Nghệ An, Hà Tĩnh, Đà Nẵng, Quảng Nam, Kontum, Darlak, Lâm Đồng, Bình Thuận, Khánh Hòa\nThế giới: Trung Quốc, Lào, Thái Lan, Mianma, Malaixia.', NULL, NULL, 'Là loài có giá trị khoa học, thẩm mỹ, giúp học sinh, sinh viên tìm hiểu về tập tính sinh thái của loài này trong tự nhiên. Chúng còn được nuôi ở những nơi vui chơi, giải trí (vườn động vật).', 'VU A1c,d + 2d.', NULL, NULL, 'https://vncreatures.net/chitiet.php?page=1&loai=1&img=1&ID=5089'),
(4972, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Trionychidae', 'Ba Ba', 'FAM_377', 'Amyda', NULL, 'GEN_0087', 'amydacartilaginea', 'Amyda cartilaginea', '(Boddaert, 1770)            ', 'Ba ba Nam bộ', 'SPA_05026', 'Cơ thể lớn, chiều dài mai tới 830mm. Có những nốt sần nhỏ, tròn xếp thành hàng dọc theo bờ trước của mai. Trên mai phủ một lớp da mỏng, rải đều có những nốt sần rất nhỏ. Đầu xám nhạt, lấm tấm những vết vàng nhỏ. Mai màu nâu hoặc xám, có những vết đốm màu vàng và xám đen; ở cá thể non có rất nhiều chấm vàng. Cua đinh sống ở các kênh rạch, sông, suối, hồ ao và vùng ngập nước, kể cả ruộng lúa nước. Là loài ăn tạp: côn trùng, tôm, cua, ốc, hến, cá,.. các loại quả và hạt.', NULL, 'Thừa Thiên - Huế, Đắk Lắk, Lâm Đồng, Khánh Hòa, Bình Thuận, Bà Rịa - Vũng Tàu, Bình Phước, Kiên Giang và vùng Nam bộ.  Lào, Cambodia, Thái Lan, Mianma, Malaixia, Indonesia và Singapor.', NULL, NULL, 'Là loài có giá trị khoa học, thẩm mỹ, giúp học sinh, sinh viên tìm hiểu về tập tính sinh thái của loài này trong tự nhiên. Hiện nay chúng được dùng làm thực phẩm và dược liệu và dùng làm thuốc vì được nhân nuôi. Ngoài ra còn được nuôi ở những nơi vui chơi, giải trí (vườn động vật). Loài ba ba phổ biến thuốc họ Ba ba Trionychidae được nuôi trong nhiều hộ gia đình.', 'VU', NULL, NULL, 'vncreatures.net'),
(4973, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Trionychidae', 'Ba Ba', 'FAM_377', 'Palea', NULL, 'GEN_1425', 'paleasteindachneri', 'Palea steindachneri', '(Siebenrock, 1906)            ', 'Ba Ba Gai', 'SPA_05027', 'Cỡ lớn, chiều dài mai có thể tới 430mm. Ở mỗi bên cổ, gần thân có 1 đám nốt sần. Mai phủ lớp da mỏng, viền trước bờ mai có 1 hàng nốt sần nhỏ. Phần cuối mai có những nốt sần to. Trên đầu có những sọc đen mảnh. Mai mầu xám nhạt, lấm tấm có những vết đen Sống chủ yếu ở các sông, suối vùng rừng núi, các vùng đầm lầy ở các khu vực rừng còn được bảo vệ. Chúng ăn chủ yếu động vật, đẻ trứng vào mùa hè, trên các bãi cát, đất ẩm gần nơi sống', NULL, 'Lai Châu, Lào Cai, Tuyên Quang, Vĩnh Phúc, Thái Nguyên, Lạng Sơn, Sơn La, Ninh Bình, Thanh Hóa, Nghệ An, Hà Tĩnh, Quảng Trị, Thừa Thiên - Huế, Quảng Nam, Kontum Nam Trung Quốc kể cả đảo Hải Nam', NULL, NULL, 'Là loài có giá trị khoa học, thẩm mỹ, giúp học sinh, sinh viên tìm hiểu về tập tính sinh thái của loài này trong tự nhiên. Hiện nay chúng được dùng làm thực phẩm và dược liệu và dùng làm thuốc vì được nhân nuôi. Ngoài ra còn được nuôi ở những nơi vui chơi, giải trí (vườn động vật)', 'VU A1c,d + 2cd', 'CR A2cd+4cd', NULL, 'VnCreature'),
(4974, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Trionychidae', 'Ba Ba', 'FAM_377', 'Pelochelys', NULL, 'GEN_1494', 'pelochelyscantorii', 'Pelochelys cantorii', 'Gray, 1864            ', 'Giải', 'SPA_05028', 'Cơ thể rất lớn, chiều dài mai tới 600mm. Đầu tương đối nhỏ nhưng rộng, mắt ở gần đỉnh mõm, mõm ngắn và tròn; vòi thịt ở mõm rất ngắn. Lưng màu vàng lục có những đốm vàng, mặt bụng màu trắng nhạt. Giải sống trong các hồ sâu, vực nước sâu ở sông và suối nơi có dòng chảy chậm và những hồ nước ngọt lớn sâu ít bị tác động khái thác, đánh bắt. Thức ăn của chúng là các loài cá. Đẻ trứng vào mùa hè.', NULL, 'Trong nước: Lai Châu, Hà Tây, Thanh Hóa, Nghệ An, Hà Tĩnh, Khánh Hòa Thế giới: Trung Quốc, Mianma, Ấn Độ, Malaixia, Indonesia (Sumatra, Java, Kalimantan), Philippin, Australlia.', NULL, NULL, 'Loài rất hiếm, có giá trị nghiên cứu khoa học và thẩm mỹ và còn được nuôi ở những nơi vui chơi giải trí như công viên, vườn động vật giúp học sinh, sinh viên tìm hiểu về tập tính sinh thái.', 'EN', 'EN', NULL, 'Agriviet'),
(4975, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Trionychidae', 'Ba Ba', 'FAM_377', 'Pelodiscus', NULL, 'GEN_1495', 'pelodiscussinensis', 'Pelodiscus sinensis', 'Wiegmann, 1835            ', 'Ba Ba Trơn', 'SPA_05029', 'Loài rùa mai mềm có kích thước trung bình. Chiều dài mai đến 45cm. Lỗ mũi dài hơn miệng, da lưng trơn màu xám xanh với những chấm đen to. Đầu có nhiều vạch và chấm đen nhỏ, hay có nhiều đốm màu trắng, đầu có mô mềm, cổ rất dài. Bụng màu trắng đục và có nhiều chấm màu xám lớn. Chân có cá ngón, giữa các ngón có màng bơi nối liền Ba ba sống ở các khe hồ nước trong rừng hay giữa các ruộng lúa nước. Ngày ngủ trong hang, hốc cây hay dưới các lớp rong rêu trên nền cát. Hoạt động vào mùa ấm, chủ yến ban đêm. Thường bơi ngược bờ suối để kiếm ăn. Khi gặp kẻ thù chúng thường lẩn trốn trong các đám rong, cỏ hoặc chui trong cát. Thức ăn của ba ba ăn cá, tôm, cua, rêu. Mùa đẻ trứng từ tháng 5 đến tháng 7, mỗi lứa đẻ 20 - 30 trứng có con đẻ tới 70 trứng, trứng nở nhờ nhiệt độ môi trường, thường sau 45 - 60 ngày', NULL, 'Phân bố rộng từ đồng bằng đến miền núi trên cả nước Trung Quốc, Đông Siberi, Thái Lan, Cambodia', NULL, NULL, 'Là loài có giá trị khoa học, thẩm mỹ, giúp học sinh, sinh viên tìm hiểu về tập tính sinh thái của loài này trong tự nhiên. Ở một số vùng loài này được nhân nuôi nên có thể làm thực phẩm và thương mại', NULL, 'VU A1d+2d', NULL, 'VnCreature'),
