(4981, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Cheloniidae', 'Vích', 'FAM_077', 'Eretmochelys', NULL, 'GEN_0665', 'eretmochelysimbricata', 'Eretmochelys imbricata', '(Linnaeus, 1766)', 'Đồi mồi', 'SPA_05035', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4982, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Geoemydidae', 'Rùa Đầm', 'FAM_156', 'Cyclemys', NULL, 'GEN_0517', 'cyclemysdentata', 'Cyclemys dentata', '(Gray, 1831)', 'Rùa dứa ', 'SPA_05036', 'Rùa dứa là loài rùa nhỏ, có những mãnh sừng trên mai cùng một kiểu hoa văn. Những con non có nhiều những đốm rõ và nhạt dần theo tuổi. Con trưởng thành thường có những sọc màu vàng hay vàng cam ở đâu và cổ. Một khớp nối ở yếm rùa lớn theo quá trình phát triển từ con non đến con trưởng thành. Yếm màu vàng, thường có những sọc ngắn trên các tấm. Đuôi nhỏ và ngắn.', NULL, 'Việt Nam: Quảng Ninh (Hòn Gai) Thế giới : Thái Lan, Mianma, Cambodia, Assam tới Java và Philippines và Malaysia', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4983, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Geoemydidae', 'Rùa Đầm', 'FAM_156', 'Cyclemys', NULL, 'GEN_0517', 'cyclemysoldhami', 'Cyclemys oldhami', 'Gray, 1863', 'Rùa đất sê pôn', 'SPA_05037', 'Con trưởng thành: Màu sẫm, giống các loài bụng sẫm màu khác nhưng mai hình chữ nhật (Hình 11) và đỉnh đầu màu nâu nhạt với các đốm đen nhỏ dễ nhận biết. Các sọc ở đầu và cổ không có ở những con trưởng thành ở phần phía tây của dãy, nhưng xuất hiện ở những con trưởng thành ở phần phía đông của dãy. Vòm miệng và lưỡi màu xám cồn. Ấp con (Hình 9): Yếm màu nâu được bao phủ bởi hình trung tâm màu tối; hoa văn hình mắt lưới ở các đường nối cận biên; có sọc ở đầu và cổ đặc biệt, cổ họng có màu sẫm. Để biết kích thước tối đa và so sánh với các đặc điểm chẩn đoán của các loài khác, xem Bảng 3 trong Fritz et al. 2008: 10. ', NULL, 'Miến Điện, Thái Lan, Việt Nam, Trung Quốc ? (Vân Nam ?); Indonesia (Sumatra)', NULL, NULL, NULL, NULL, NULL, NULL, 'https://reptile-database.reptarium.cz/species?genus=Cyclemys&species=oldhamii&search_param=%28%29'),
(4984, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Geoemydidae', 'Rùa Đầm', 'FAM_156', 'Cyclemys', NULL, 'GEN_0517', 'cyclemyspulchristriata', 'Cyclemys pulchristriata', 'Fritz, Gaulke and Lehr, 1997         ', 'Rùa dứa sọc', 'SPA_05038', 'Ở loài này, mai có màu nâu đỏ, hình trứng đến thon dài, có các đường màu đen rộng, tỏa ra hoặc các đốm lớn màu đen. Plastron chủ yếu có màu vàng và có thể có các đường ngắn, mập, lốm đốm hoặc có màu đồng nhất. Đầu có lốm đốm, cổ họng màu vàng. Cổ có sọc. Gà con có sọc rộng ở đầu và cổ và yếm màu vàng. Cây cầu chủ yếu có màu vàng với sọc đen hoặc đen hoàn toàn. Về mặt hình thái, nó hầu như không thể phân biệt được với loài rùa lá cầu đen phương Tây , C. atripons , cần phải lấy mẫu di truyền để xác định một cách chắc chắn. [6] [7] Một số nhà nghiên cứu coi loài này là đồng nghĩa hoặc một phân loài của C. atripons', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://en.wikipedia.org/wiki/Eastern_black-bridged_leaf_turtle'),
(4985, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Geoemydidae', 'Rùa Đầm', 'FAM_156', 'Cyclemys', NULL, 'GEN_0517', 'cyclemystcheponensis', 'Cyclemys tcheponensis', '(Bourret, 1939)            ', 'Rùa đất Sê pôn', 'SPA_05039', 'Rùa đất sêpôn là loài có kích thước trung bình, mai rùa có thể dài đến 22cm; có một gờ giữa lưng nhưng không rõ rệt. mai màu xám nâu hoặc nâu sẫm. Có vài sọc màu hồng phía dưới cổ mở rộng về phía dưới ổ mắt đến tận mũi và cằm. Con đực có đuôi dài và dầy hơn con cái . Thức ăn chủ yếu của chúng là giun đất, côn trùng, cá, tôm và hoa quả, rau xanh. Hiện chưa có số liệu về sinh sản của chúng. Chúng sống ở các sông suối ở khu vực miền núi, thích bò lên cạn.', NULL, 'Việt Nam: Lai Châu (Chà Cang), Hoà Bình (Mai Châu) Hà Tĩnh (Vũ Quang), Quảng Trị, Gia Lai (Sơklang), Đồng Nai (VQG Cát Tiên) Thế giới: Lào, Cambodia', NULL, NULL, NULL, NULL, 'LR', NULL, 'Vn Creature'),
(4986, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Geoemydidae', 'Rùa Đầm', 'FAM_156', 'Heosemys', NULL, 'GEN_0863', 'heosemysannandalii', 'Heosemys annandalii', 'Boulenger, 1903', 'Rùa răng', 'SPA_05040', 'Cơ thể lớn, chiều dài mai tới 470mm. Rùa răng có mỏ làm thành 2 mấu nhọn hình răng ở hàm trên. Mai phồng, thuôn dài, bờ sau mai không có răng cưa. Bờ trước yếm lồi, bờ sau yếm khuyết, bờ bên phần sau yếm thẳng. Chân dẹp, ngón chân có màng da. Mai màu nâu thẫm hay đen. Đầu xám có những vết đốm đen và vàng, hàm màu vàng.', NULL, 'Trong nước: Đồng Nai, Kiên Giang, Cà Mau. Thế giới: Lào, Cămpuchia, Thái Lan, Malaixia.', NULL, NULL, 'Có giá trị khoa học, thẩm mỹ giúp học sinh sinh viên tìm hiểu về tập tính sinh thái của loài này trong tự nhiên. Chúng còn được nuôi ở nơi vui chơi, giải trí (vườn động vật).', 'EN', NULL, NULL, 'https://agriviet.org/dong-vat-rung/rua-rang-r125/'),
(4987, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Geoemydidae', 'Rùa Đầm', 'FAM_156', 'Heosemys', NULL, 'GEN_0863', 'heosemysgrandis', 'Heosemys grandis', '(Gray, 1860)            ', 'Rùa đất lớn', 'SPA_05041', 'Cỡ lớn, chiều dài mai tới 400mm. Mai cao, có 1 gờ sống lưng. Bờ sau mai có răng cưa rõ. Đặc biệt, tấm bìa 1 thường có góc lồi khỏi bờ mai rõ ràng và có hình tam giác. Bờ trước yếm gần như thẳng, bờ sau yếm khuyết. Đuôi rất ngắn. Mai rùa màu nâu thẫm. Yếm màu vàng nhạt hay nâu nhạt, các tấm yếm có những tia màu nâu sẫm hay đen từ những chấm đen trên từng tấm yếm. Rùa sống ở ao, sông, suối, đầm lầy có nước chảy chậm trên nhiều địa hình có độ cao khác nhau. Thức ăn của chúng là quả, thực vật thuỷ sinh và động vật nhỏ, trong điều kiện nuôi chúng rất thích ăn chuối chín. Rùa đẻ trứng vào tháng 12 đến tháng 1 năm sau.', NULL, 'Gia Lai, Darklak, Đồng Nai, Bình Phước và các tỉnh Nam Bộ.  Lào, Cambodia, Thái Lan, Mianma, Malaysia.', NULL, NULL, 'Có giá trị nghiên cứu khoa học và thẩm mỹ. Rùa còn được nuôi ở những nơi vui chơi giải trí như công viên, vườn động vật giúp học sinh, sinh viên tìm hiểu về tập tính sinh thái.', 'VU', NULL, NULL, 'vncreatures.net'),
(4988, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Geoemydidae', 'Rùa Đầm', 'FAM_156', 'Malayemys', NULL, 'GEN_1156', 'malayemyssubtrijuga', 'Malayemys subtrijuga', '(Schlegel et Muller, 1844)', 'Rùa ba gờ', 'SPA_05042', 'Cỡ trung bình, chiều dài mai tới 210mm. Trên mai có 3 gờ rõ ràng, bờ sau mai không có răng cưa. Bờ trước yếm gần thẳng, bờ sau yếm lõm. Đầu to, có sọc màu vàng (1 sọc từ mút mõm qua phía trên ổ mắt về phía cổ, 1 sọc từ mũi qua phía dưới ổ mắt tới cổ và 1 đốm trắng ở phía sau ổ mắt). Mai màu nâu sáng hoặc sẫm, đôi khi nâu đỏ, rìa mai màu trắng đục hay vàng rất nhạt. Yếm vàng nhạt có những đốm xám đen trên từng tấm yếm. Rùa sống ở kênh, rạch, hồ ao, đầm lầy kể cả ruộng lúa nước, nơi nước chảy chậm. Chúng ăn chủ yếu động vật: cua, tôm, côn trùng, giun, cá nhỏ, đặc biệt thích ăn ốc, trai, hến.', NULL, 'Trong nước: Đồng Nai, Cần Thơ, Kiên Giang, Cà Mau. Thế giới: Cambodia, Lào, Thái Lan, Malaixia, Indonesia.', NULL, NULL, 'Có giá trị khoa học, thẩm mỹ, giúp học sinh, sinh viên tìm hiểu về tập tính sinh thái của loài này trong tự nhiên. Chúng còn được nuôi ở những nơi vui chơi, giải trí (vườn động vật).', 'VU', NULL, NULL, 'VnCreature'),
(4989, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Geoemydidae', 'Rùa Đầm', 'FAM_156', 'Siebenrockiella', NULL, 'GEN_1817', 'siebenrockiellacrassicollis', 'Siebenrockiella crassicollis', '(Gray, 1830)', 'Rùa cổ bự', 'SPA_05043', 'Đầu sẫm màu có một khoang trắng hoặc phớt vàng về phía sau mỗi mắt. Đầu rộng có hàm cong (gần giống dạng cười). Mai màu đen tuyền. Yếm màu nâu đen và có các chùm tia hình dẻ quạt màu đen hoặc yếm màu đen tuyền. Kích thước mai có thể đến 20cm. Những cá thể còn non có màu sắng giống như các cá thể trưởng thành. Loài rùa này di chuyển chậm chạp và bơi lội kém linh hoạt, chúng thích những nơi nước lặng; cạn, đất trũng và có nhiều mầm thực vật. Thức ăn là loài ăn tạp, động vật không xương sống dưới các ao hồ nước, xác động vật chết và thực vật thủy sinh', NULL, 'vùng Nam bộ Đồng Nai, Bình Dương, Bình Phước cho đến Cà Mau hái Lan, bán đảo Mã Lai, đảo Sumatra, Borneo và Java. Đồng bằng sông Mêkông', NULL, NULL, NULL, NULL, NULL, NULL, 'vncreatures'),
(4990, 'CHORDATA', 'ĐỘNG VẬT CÓ XƯƠNG SỐNG', 'PHY_03', 'REPTILIA', 'BÒ SÁT', 'CLA_11', 'TESTUDINES', 'RÙA', 'ORD_091', 'Platysternidae', 'Rùa Đầu To', 'FAM_294', 'Platysternon', NULL, 'GEN_1583', 'platysternonmegacephalum', 'Platysternon megacephalum', 'GRAY, 1831            ', 'Rùa đầu to', 'SPA_05044', 'Rùa cỡ trung bình nhỏ. Đầu to, không thụt vào trong mai được. Bên đầu có một vệt vàng nhạt chạy từ mắt tới cổ. Mỏ to, giống như mỏ chim vẹt. Mai rất dẹp, màu xám. Bụng màu vàng rất nhạt. Đuôi dài và to gần bằng dài thân. Lưng hình mái, cao ở đỉnh, có gờ rất rõ và thuôn xuống hai bên. Rùa sống ở các suối trong rừng thường xanh núi cao còn tốt. Nơi có nhiều đá tảng, nước sâu, trong và có dòng chảy chậm. Ban ngày chúng ẩn dưới các tảng đá hoặc phơi nắng bên bờ suối. Rùa kiếm ăn vào lúc xẩm tối hoặc ban đêm. Thức ăn chủ yếu là cá nhỏ, thân mềm, cua, giun đất và những động vật không xương sống khác. Rùa đẻ 2 trứng vào mùa hè.', NULL, 'Hà Giang, Cao Bằng, Lào Cai, Lai Châu, Tuyên Quang, Bắc Kạn, Thái Nguyên, Lạng Sơn, Sơn La, Thanh Hoá, Nghệ An, Hà Tĩnh, Quảng Trị, Thừa Thiên - Huế, Quảng Nam, Kontum, Gia Lai. Trung Quốc, Mianma, Thái Lan, Lào, Cambodia.', NULL, NULL, 'Có giá trị khoa học, thẩm mỹ giúp học sinh sinh viên tìm hiểu về tập tính sinh thái của loài này trong tự nhiên.', 'EN', NULL, NULL, 'Vncreatures'),
